{"first_name": "Th\u00ea\u0301 B\u1ea1ch", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, Th\u1ebf c\u00f3 ngh\u0129a l\u00e0 quy\u1ec1n l\u1ef1c, s\u1ee9c m\u1ea1nh, uy l\u1ef1c. \"B\u1ea1ch\" theo ti\u1ebfng H\u00e1n - Vi\u00ea\u0323t, c\u00f3 ngh\u0129a l\u00e0 tr\u1eafng, s\u00e1ng, m\u00e0u c\u1ee7a \u0111\u1ee9c h\u1ea1nh, t\u1eeb bi, tr\u00ed tu\u1ec7, th\u1ec3 hi\u1ec7n s\u1ef1 thanh cao c\u1ee7a t\u00e2m h\u1ed3n. T\u00ean \"Th\u1ebf B\u1ea1ch\" th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi kh\u1ecfe m\u1ea1nh, uy nghi, t\u00e0i gi\u1ecfi v\u00e0 c\u00f3 t\u00e2m h\u1ed3n ph\u00fac h\u1eadu, t\u00e2m trong s\u00e1ng, \u0111\u01a1n gi\u1ea3n th\u1eb3ng ngay, s\u1ed1ng t\u1eeb bi & gi\u00e0u tr\u00ed tu\u1ec7.", "sex": 3}
