{"first_name": "S\u01a1n B\u00e1ch", "meaning": "\"S\u01a1n\" l\u00e0 mong mu\u1ed1n cho con m\u00ecnh v\u1eefng v\u00e0ng trong cu\u1ed9c s\u1ed1ng. T\u00ean \"B\u00e1ch\" \u0111\u1eb7t cho con v\u1edbi mong mu\u1ed1n r\u1eb1ng con lu\u00f4n gi\u1eef l\u1ebd th\u1eb3ng ngay, kh\u00f4ng ch\u1ecbu c\u00fai \u0111\u1ea7u hay khu\u1ea5t ph\u1ee5c. \u0110\u00e2y c\u0169ng l\u00e0 lo\u00e0i c\u00e2y mang m\u1ed9t s\u1ee9c s\u1ed1ng m\u00e3nh li\u1ec7t, ti\u1ec1m t\u00e0ng, n\u00ean c\u00f3 \u00fd ngh\u0129a r\u1eb1ng con m\u00ecnh c\u0169ng s\u1ebd b\u1ec1n b\u1ec9, m\u1ea1nh m\u1ebd, bi\u1ebft ch\u1ecbu \u0111\u1ef1ng v\u00e0 v\u01b0\u1ee3t qua gian kh\u1ed5. Gh\u00e9p 2 ch\u1eef n\u00e0y th\u00e0nh t\u00ean cho con, b\u1ed1 m\u1eb9 mong r\u1eb1ng con s\u1ebd \u0111\u1ea1t \u0111\u01b0\u1ee3c nh\u1eefng \u0111i\u1ec1u tuy\u1ec7t v\u1eddi nh\u01b0 ch\u00ednh c\u00e1i t\u00ean v\u1eady.", "sex": 3}
