{"first_name": "H\u1ea3i Gia", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"H\u1ea3i\" c\u00f3 ngh\u0129a l\u00e0 bi\u1ec3n, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. T\u00ean \"H\u1ea3i\" th\u01b0\u1eddng g\u1ee3i h\u00ecnh \u1ea3nh m\u00eanh m\u00f4ng c\u1ee7a bi\u1ec3n c\u1ea3, m\u1ed9t c\u1ea3nh thi\u00ean nhi\u00ean kh\u00e1 quen thu\u1ed9c v\u1edbi cu\u1ed9c s\u1ed1ng con ng\u01b0\u1eddi. T\u00ean \"h\u1ea3i\" c\u0169ng th\u1ec3 hi\u1ec7n s\u1ef1 kho\u00e1ng \u0111\u1ea1t, t\u1ef1 do, t\u1ea5m l\u00f2ng r\u1ed9ng m\u1edf nh\u01b0 h\u00ecnh \u1ea3nh c\u1ee7a bi\u1ec3n kh\u01a1i.\"Gia\" l\u00e0 lo\u00e0i c\u1ecf lau, mang l\u1ea1i \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p, ph\u00fac l\u00e0nh. \"Gia\" trong ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f2n l\u00e0 gia \u0111\u00ecnh, l\u00e0 m\u00e1i nh\u00e0 n\u01a1i m\u1ecdi ng\u01b0\u1eddi sum v\u1ea7y, sinh ho\u1ea1t b\u00ean nhau. Ngo\u00e0i ra ch\u1eef Gia c\u00f2n c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p, \u01b0u t\u00fa, mang ph\u1ea9m ch\u1ea5t cao qu\u00fd. \"H\u1ea3i Gia\" mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi c\u00f3 ch\u00ed l\u1edbn bao la nh\u01b0 bi\u1ec3n c\u1ea3 v\u00e0 lu\u00f4n l\u00e0 ng\u01b0\u1eddi con bi\u1ebft h\u01b0\u1edbng v\u1ec1 gia \u0111\u00ecnh, con l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh t\u00e0i gi\u1ecfi.", "sex": 3}
