{"first_name": "Linh Giang", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Linh\" c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u1eb9n, th\u00f4ng minh. T\u00ean \"Linh\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi h\u00e0m \u00fd t\u1ed1t l\u00e0nh, th\u1ec3 hi\u1ec7n s\u1ef1 \u1ee9ng nghi\u1ec7m m\u00e0u nhi\u1ec7m c\u1ee7a nh\u1eefng \u0111i\u1ec1u th\u1ea7n k\u00ec, ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi dung m\u1ea1o \u0111\u00e1ng y\u00eau, t\u00e0i hoa, tinh anh, nhanh nh\u1eb9n, th\u00f4ng minh & lu\u00f4n g\u1eb7p may m\u1eafn, \u0111\u01b0\u1ee3c che ch\u1edf, gi\u00fap \u0111\u1ee1 trong cu\u1ed9c s\u1ed1ng.\"Giang\" l\u00e0 d\u00f2ng s\u00f4ng, th\u01b0\u1eddng ch\u1ec9 nh\u1eefng \u0111i\u1ec1u cao c\u1ea3, l\u1edbn lao. Ng\u01b0\u1eddi ta th\u01b0\u1eddng l\u1ea5y t\u00ean Giang \u0111\u1eb7t t\u00ean v\u00ec th\u01b0\u1eddng th\u00edch nh\u1eefng h\u00ecnh \u1ea3nh con s\u00f4ng v\u1eeba \u00eam \u0111\u1ec1m, v\u1eeba m\u1ea1nh m\u1ebd nh\u01b0 cu\u1ed9c \u0111\u1eddi con ng\u01b0\u1eddi c\u00f3 l\u00fac th\u0103ng c\u00f3 l\u00fac tr\u1ea7m.\"Linh Giang\" con l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh nhanh nh\u1eb9n, \u0111\u00e1ng y\u00eau t\u00e0i hoa, lu\u00f4n g\u1eb7p may m\u1eafn trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
