{"first_name": "Mai Giang", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Mai\" l\u00e0  t\u00ean m\u1ed9t lo\u00e0i hoa \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho con. Hoa mai l\u00e0 m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p n\u1edf v\u00e0o \u0111\u1ea7u m\u00f9a xu\u00e2n - m\u1ed9t m\u00f9a xu\u00e2n tr\u00e0n tr\u1ec1 \u01b0\u1edbc m\u01a1 v\u00e0 hy v\u1ecdng. T\u00ean \"Mai\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 v\u00f3c d\u00e1ng thanh t\u00fa, lu\u00f4n tr\u00e0n \u0111\u1ea7y s\u1ee9c s\u1ed1ng \u0111\u1ec3 b\u1eaft \u0111\u1ea7u m\u1ecdi vi\u1ec7c.\"Giang\" l\u00e0 d\u00f2ng s\u00f4ng, th\u01b0\u1eddng ch\u1ec9 nh\u1eefng \u0111i\u1ec1u cao c\u1ea3, l\u1edbn lao. Ng\u01b0\u1eddi ta th\u01b0\u1eddng l\u1ea5y t\u00ean Giang \u0111\u1eb7t t\u00ean v\u00ec th\u01b0\u1eddng th\u00edch nh\u1eefng h\u00ecnh \u1ea3nh con s\u00f4ng v\u1eeba \u00eam \u0111\u1ec1m, v\u1eeba m\u1ea1nh m\u1ebd nh\u01b0 cu\u1ed9c \u0111\u1eddi con ng\u01b0\u1eddi c\u00f3 l\u00fac th\u0103ng c\u00f3 l\u00fac tr\u1ea7m.\"Mai Giang\" mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p, thanh t\u00fa, lu\u00f4n tr\u00e0n \u0111\u1ea7y s\u1ee9c s\u1ed1ng nh\u01b0 m\u00f9a xu\u00e2n nhi\u1ec1u ni\u1ec1m vui v\u00e0 hy v\u1ecdng.", "sex": 5}
