{"first_name": "\u00c1i Giao", "meaning": "T\u00ean \"\u00c1i\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. \"\u00c1i\" c\u00f2n \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 n\u00f3i v\u1ec1 ng\u01b0\u1eddi ph\u1ee5 n\u1eef c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, \u0111oan trang. \"Giao\" theo ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 t\u00ean c\u1ee7a lo\u00e0i c\u1ecf giao, mong manh, b\u00ecnh d\u1ecb, nh\u01b0ng c\u00f3 s\u1ee9c s\u1ed1ng m\u00e3nh li\u1ec7t. T\u00ean \"\u00c1i Giao\" \u0111\u1eb7t cho con th\u1ec3 hi\u1ec7n con l\u00e0 ng\u01b0\u1eddi tuy nh\u1ecf b\u00e9 nh\u01b0ng s\u1ee9c s\u1ed1ng m\u00e3nh li\u1ec7t, c\u00f3 dung nhan v\u00e0 ph\u1ea9m h\u1ea1nh n\u1ebft na, con \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng.", "sex": 5}
