{"first_name": "B\u00edch Giao", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"B\u00edch\" l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t lo\u00e0i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng.\"Giao\" l\u00e0 lo\u00e0i c\u1ecf giao, c\u00f3 ti\u1ebfng t\u0103m v\u1eefng b\u1ec1n.\"B\u00edch Giao\" Con l\u00e0 lo\u00e0i \u0111\u00e1 qu\u00fd, trong s\u00e1ng b\u1ec1n v\u1eefng.Ba m\u1eb9 mong mu\u1ed1n \u1edf con c\u0169ng tr\u1edf n\u00ean trong s\u00e1ng b\u1ec1n v\u1eefng nh\u01b0 lo\u1ea1i \u0111\u00e3 qu\u00fd c\u00f3 t\u1eeb l\u00e2u \u0111\u1eddi.", "sex": 5}
{"first_name": "B\u00ecnh Giao", "meaning": "\"B\u00ecnh\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 c\u00f4ng b\u1eb1ng, ngang nhau kh\u00f4ng thi\u00ean l\u1ec7ch. \"Giao\" l\u00e0 t\u00ean lo\u00e0i c\u1ecf giao mong manh, b\u00ecnh d\u1ecb, m\u1ea1nh m\u1ebd v\u00e0 \u00fd ch\u00ed. T\u00ean \"B\u00ecnh Giao\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 c\u1ed1t c\u00e1ch, bi\u1ebft ph\u00e2n \u0111\u1ecbnh r\u1ea1ch r\u00f2i, t\u00ednh kh\u00ed \u00f4n h\u00f2a, bi\u1ebft \u0111i\u1ec1u ph\u1ed1i c\u00f4ng vi\u1ec7c, th\u00e1i \u0111\u1ed9 tr\u01b0\u1edbc cu\u1ed9c s\u1ed1ng lu\u00f4n b\u00ecnh t\u0129nh, an \u0111\u1ecbnh. \"B\u00ecnh Giao\" tuy nh\u1ecf b\u00e9, mong manh nh\u01b0ng \u00fd ch\u00ed m\u1ea1nh m\u1ebd, kh\u00f4ng d\u1ec5 \u0111\u1ea7u h\u00e0ng.", "sex": 7}
{"first_name": "C\u1ea9m Giao", "meaning": "\"C\u1ea9m\" l\u00e0 t\u00ean c\u1ee7a 1 lo\u1ea1i g\u1ed7 \u0111\u1eb9p, qu\u00fd hi\u1ebfm. \"Giao\" l\u00e0 t\u00ean c\u1ee7a lo\u00e0i c\u1ecf giao, mong manh, b\u00ecnh d\u1ecb nh\u01b0ng m\u1ea1nh m\u1ebd, \u00fd ch\u00ed. \"C\u1ea9m Giao\" c\u00f3 ngh\u0129a l\u00e0 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, cao qu\u00fd, hi\u1ec1n l\u00e0nh nh\u01b0ng n\u1ed9i l\u1ef1c m\u1ea1nh m\u1ebd v\u00e0 \u00fd ch\u00ed.", "sex": 5}
{"first_name": "Di\u1ec7p Giao", "meaning": "Theo ti\u1ebfng H\u00e1n- Vi\u1ec7t l\u00e0 ch\u1eef \"Di\u1ec7p\" ch\u00ednh l\u00e0 \"l\u00e1\" trong Kim Chi Ng\u1ecdc Di\u1ec7p (d\u1ecbch l\u00e0 c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc), c\u00f2n \"Giao\" l\u00e0 t\u00ean c\u1ee7a lo\u00e0i c\u1ecf giao, mong manh, b\u00ecnh d\u1ecb nh\u01b0ng m\u1ea1nh m\u1ebd, \u00fd ch\u00ed. V\u00ec v\u1eady, \u0111\u1eb7t t\u00ean \"Di\u1ec7p Giao\"  cho con ng\u1ee5 \u00fd mu\u1ed1n n\u00f3i con nh\u00e0 quy\u1ec1n qu\u00fd sang gi\u00e0u, d\u00f2ng d\u00f5i danh gi\u00e1, xinh \u0111\u1eb9p, hi\u1ec1n l\u00e0nh nh\u01b0ng b\u1ea3n t\u00ednh c\u1ee9ng c\u1ecfi kh\u00f4ng d\u1ec5 d\u00e0ng \u0111\u1ea7u h\u00e0ng.", "sex": 5}
{"first_name": "Di\u1ec7u Giao", "meaning": "\"Di\u1ec7u\" theo ngh\u0129a H\u00e1n- Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 \u0111\u1eb9p, l\u00e0 tuy\u1ec7t di\u1ec7u, \u00fd ch\u1ec9 nh\u1eefng \u0111i\u1ec1u tuy\u1ec7t v\u1eddi \u0111\u01b0\u1ee3c t\u1ea1o n\u00ean b\u1edfi s\u1ef1 kh\u00e9o l\u00e9o, k\u00ec di\u1ec7u. \"Giao\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u00ean lo\u00e0i c\u1ecf giao mong manh, b\u00ecnh d\u1ecb nh\u01b0ng m\u1ea1nh m\u1ebd, \u00fd ch\u00ed. T\u00ean \"Di\u1ec7u Giao\" mang l\u1ea1i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0ng v\u1eabn cu\u1ed1n h\u00fat, \u1ea5n t\u01b0\u1ee3ng, ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p tuy\u1ec7t di\u1ec7u, c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh d\u1ecb, c\u00f3 n\u1ed9i l\u1ef1c ti\u1ec1m t\u00e0ng, m\u1ea1nh m\u1ebd, \u00fd ch\u00ed.", "sex": 5}
{"first_name": "H\u1ea1 Giao", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"H\u1ea1\" c\u00f2n \u0111\u01b0\u1ee3c hi\u1ec3u l\u00e0 s\u1ef1 an nh\u00e0n, r\u00e3nh r\u1ed7i, ch\u1ec9 s\u1ef1 th\u01b0 th\u00e1i.\"Giao\" l\u00e0 lo\u00e0i c\u1ecf giao, c\u00f3 ti\u1ebfng t\u0103m v\u1eefng b\u1ec1n.\"H\u1ea1 Giao\" con l\u00e0 ng\u01b0\u1eddi c\u00f3 ti\u1ebfng t\u0103m \u0111\u1ecba v\u1ecb , v\u00e0 l\u00e0 ng\u01b0\u1eddi s\u1ed1ng anh nh\u00e0n  th\u01b0 th\u00e1i.", "sex": 5}
{"first_name": "H\u1ea3i Giao", "meaning": "Theo ngh\u0129a H\u00e1n, \"H\u1ea3i\" c\u00f3 ngh\u0129a l\u00e0 bi\u1ec3n, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. \"Giao\" l\u1ea1i l\u00e0 t\u00ean c\u1ee7a loa\u0300i co\u0309 giao b\u00ecnh d\u1ecb, m\u1ed9c m\u1ea1c nh\u01b0ng c\u00f3 s\u1ee9c s\u1ed1ng m\u1ea1nh m\u1ebd, \u00fd ch\u00ed. T\u00ean \"H\u1ea3i Giao\" th\u01b0\u1eddng th\u1ec3 hi\u1ec7n s\u1ef1 kho\u00e1ng \u0111\u1ea1t, t\u1ef1 do, t\u1ea5m l\u00f2ng r\u1ed9ng m\u1edf nh\u01b0 h\u00ecnh \u1ea3nh c\u1ee7a bi\u1ec3n kh\u01a1i, b\u00ecnh d\u1ecb m\u1ed9c m\u1ea1c nh\u01b0 c\u1ecf c\u00e2y nh\u01b0ng l\u1ea1i \u1ea9n ch\u1ee9a s\u1ee9c s\u1ed1ng ti\u1ec1m t\u00e0ng, kh\u00f4ng d\u1ec5 \u0111\u1ea7u h\u00e0ng.", "sex": 3}
