{"first_name": "H\u1ea1nh Giao", "meaning": "Theo H\u00e1n - Vi\u1ec7t, t\u00ean \"H\u1ea1nh\" th\u1ee9 nh\u1ea5t, c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 ph\u00fac l\u1ed9c, l\u00e0 ph\u01b0\u1edbc l\u00e0nh. Ngh\u0129a th\u1ee9 hai l\u00e0 n\u00f3i v\u1ec1 m\u1eb7t \u0111\u1ea1o \u0111\u1ee9c, t\u00ednh n\u1ebft c\u1ee7a con ng\u01b0\u1eddi. \"Giao\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u00ean c\u1ee7a lo\u00e0i c\u1ecf giao b\u00ecnh d\u1ecb. T\u00ean \"H\u1ea1nh Giao\" th\u01b0\u1eddng d\u00f9ng cho n\u1eef, ch\u1ec9 ng\u01b0\u1eddi n\u1ebft na, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, \u0111\u00f4n h\u1eadu, ph\u1ea9m ch\u1ea5t cao \u0111\u1eb9p, c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh d\u1ecb m\u1ed9c m\u1ea1c, gi\u00e0u s\u1ee9c s\u1ed1ng m\u1ea1nh m\u1ebd v\u00e0 \u00fd ch\u00ed kh\u00f4ng d\u1ec5 khu\u1ea5t ph\u1ee5c.", "sex": 5}
{"first_name": "Hi\u1ec1n Giao", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, khi n\u00f3i v\u1ec1 ng\u01b0\u1eddi th\u00ec \"Hi\u1ec1n\" c\u00f3 ngh\u0129a l\u00e0 t\u1ed1t l\u00e0nh, c\u00f3 t\u00e0i c\u00f3 \u0111\u1ee9c. T\u00ean \"Hi\u1ec1n\" ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 t\u00ednh \u00f4n h\u00f2a, \u0111\u1eb1m th\u1eafm, d\u00e1ng v\u1ebb, c\u1eed ch\u1ec9 nh\u1eb9 nh\u00e0ng, th\u00e2n thi\u1ec7n, c\u00f3 t\u00e0i n\u0103ng & \u0111\u1ee9c h\u1ea1nh. \"Giao\" l\u00e0 t\u00ean c\u1ee7a lo\u00e0i c\u1ecf. \"Hi\u1ec1n Giao\" c\u00f3 \u00fd ngh\u0129a ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p t\u00e0i \u0111\u1ee9c, c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh d\u1ecb, hi\u1ec1n h\u00f2a nh\u01b0 c\u1ecf c\u00e2y, nh\u01b0ng c\u0169ng m\u1ea1nh m\u1ebd, ki\u00ean c\u01b0\u1eddng kh\u00f4ng d\u1ec5 \u0111\u1ea7u h\u00e0ng.", "sex": 5}
{"first_name": "H\u00f2a Giao", "meaning": "\"H\u00f2a\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 \u00eam \u1ea5m, y\u00ean \u1ed5n ch\u1ec9 s\u1ef1 thu\u1eadn h\u1ee3p. \"Giao\" l\u00e0 t\u00ean c\u1ee7a m\u1ed9t lo\u1ea1i c\u1ecf m\u1ed9c m\u1ea1c, b\u00ecnh d\u1ecb nh\u01b0ng m\u1ea1nh m\u1ebd \u0111\u1ea7y s\u1ee9c s\u1ed1ng. T\u00ean \"H\u00f2a Giao\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 v\u1ec1 \u0111\u1ee9c t\u00ednh con ng\u01b0\u1eddi, hi\u1ec1n l\u00e0nh, th\u00e1i \u0111\u1ed9 t\u1eeb t\u1ed1n, m\u1ec1m m\u1ecfng, ng\u00f4n ng\u1eef nh\u1ecf nh\u1eb9, \u00f4n h\u00f2a. Tuy v\u1eady nh\u01b0ng c\u0169ng \u1ea9n ch\u1ee9a s\u1ee9c s\u1ed1ng m\u1ea1nh m\u1ebd, kh\u00f4ng d\u1ec5 khu\u1ea5t ph\u1ee5c.", "sex": 5}
{"first_name": "Ho\u00e0i Giao", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ho\u00e0i\" c\u00f3 ngh\u0129a l\u00e0 nh\u1edb, l\u00e0 mong ch\u1edd, tr\u00f4ng ng\u00f3ng. T\u00ean \"Ho\u00e0i\" trong tr\u01b0\u1eddng h\u1ee3p n\u00e0y th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t d\u1ef1a tr\u00ean t\u00e2m t\u01b0 t\u00ecnh c\u1ea3m c\u1ee7a b\u1ed1 m\u1eb9 \"Giao\" l\u00e0 lo\u00e0i c\u1ecf giao, c\u00f3 ti\u1ebfng t\u0103m v\u1eefng b\u1ec1n.\"Ho\u00e0i Giao\" Con l\u00e0 ng\u01b0\u1eddi s\u1ed1ng t\u00ecnh c\u1ea3m, lu\u00f4n nh\u1edb v\u1ec1 nh\u1eefng k\u00fd \u1ee9c v\u00e0 l\u00e0 ng\u01b0\u1eddi c\u00f3 \u00fd ch\u00ed quy\u1ebft t\u00e2m b\u1ec1n v\u1eefng.", "sex": 5}
