{"first_name": "D\u00e2n An", "meaning": "T\u00ean con th\u00ea\u0309 hi\u00ea\u0323n kh\u00e1t v\u1ecdng c\u1ea7u mong qu\u1ed1c th\u00e1i d\u00e2n an, thi\u00ean h\u1ea1 th\u00e1i b\u00ecnh. Cho\u0323n cho con ca\u0301i t\u00ean \"D\u00e2n An\", ba m\u1eb9 mong mu\u1ed1n con co\u0301 su\u00f4\u0323c s\u00f4\u0301ng an la\u0300nh, y\u00ean \u00f4\u0309n, h\u01b0\u01a1\u0301ng thi\u1ec7n \u0111\u1ec3 c\u00f3 t\u01b0\u01a1ng lai s\u00e1ng l\u1ea1n...", "sex": 3}
{"first_name": "\u0110\u0103ng An", "meaning": "\"\u0110\u0103ng\" ngh\u0129a l\u00e0 ng\u1ecdn \u0111\u00e8n c\u1ee7a s\u1ef1 soi s\u00e1ng & tinh anh. T\u00ean \"An\" l\u00e0 t\u00ean nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. \u0110\u1eb7t t\u00ean con l\u00e0 \"\u0110\u0103ng An\", th\u00ea\u0309 hi\u00ea\u0323n r\u0103\u0300ng con nh\u01b0 a\u0301nh sa\u0301ng cu\u0309a ho\u0300a bi\u0300nh, cu\u0309a an la\u0300nh, co\u0301 tri\u0301 tu\u00ea\u0323 s\u00e1ng su\u1ed1t \u0111\u1ec3 c\u00f3 t\u01b0\u01a1ng lai s\u00e1ng l\u1ea1n...", "sex": 3}
{"first_name": "Di An", "meaning": "\"Di\" ngh\u0129a l\u00e0 vui v\u1ebb, sung s\u01b0\u1edbng. T\u00ean \"An\" nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. V\u00ec v\u1eady khi \u0111\u1eb7t t\u00ean \"Di An\" cho con, b\u1ed1 m\u1eb9 hi v\u1ecdng cu\u1ed9c s\u1ed1ng c\u1ee7a con lu\u00f4n \u0111\u1ea7y \u1eafp ni\u1ec1m vui v\u00e0 ti\u1ebfng c\u01b0\u1eddi, con c\u00f3 m\u1ed9t s\u1ed1 m\u1ec7nh may m\u1eafn, bi\u0300nh an.", "sex": 5}
