{"first_name": "Di\u1ec5m An", "meaning": "\"Di\u1ec5m\" \u00fd ch\u1ec9 t\u1ed1t \u0111\u1eb9p, v\u1ebb t\u01b0\u01a1i s\u00e1ng, xinh \u0111\u1eb9p l\u1ed9ng l\u1eaby th\u01b0\u1eddng ng\u1ee5 \u00fd ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p, y\u1ec3u \u0111i\u1ec7u. T\u00ean \"An\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 m\u1ed9t c\u00e1i t\u00ean nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. \"Di\u1ec5m An\" l\u00e0 t\u00ean ph\u1ed5 bi\u1ebfn d\u00e0nh cho con g\u00e1i v\u1edbi ng\u1ee5 \u00fd ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, t\u01b0\u01a1i s\u00e1ng v\u00e0 mang v\u1ebb \u0111\u1eb9p t\u00e2m h\u1ed3n thu\u1ea7n khi\u1ebft.", "sex": 5}
{"first_name": "Di\u00ea\u0323u An", "meaning": "\"Di\u1ec7u\" theo ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 \u0111\u1eb9p, l\u00e0 tuy\u1ec7t di\u1ec7u, \u00fd ch\u1ec9 nh\u1eefng \u0111i\u1ec1u tuy\u1ec7t v\u1eddi \u0111\u01b0\u1ee3c t\u1ea1o n\u00ean b\u1edfi s\u1ef1 kh\u00e9o l\u00e9o, k\u00ec di\u1ec7u. \"An\" l\u00e0 t\u00ean nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. \"Di\u1ec7u An\" mang l\u1ea1i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0ng v\u1eabn cu\u1ed1n h\u00fat, \u1ea5n t\u01b0\u1ee3ng n\u00ean th\u01b0\u1eddng ph\u00f9 h\u1ee3p \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i.", "sex": 5}
{"first_name": "\u0110\u00ecnh An", "meaning": "\u0110\u00ecnh l\u00e0 n\u01a1i quan vi\u00ean l\u00e0m vi\u1ec7c. \u0110\u00ecnh An l\u00e0 y\u00ean \u1ed5n ch\u1ed1n quan vi\u00ean, ch\u1ec9 ng\u01b0\u1eddi th\u00e0nh \u0111\u1ea1t, t\u1ed1t \u0111\u1eb9p", "sex": 3}
{"first_name": "\u0110\u00f4ng An", "meaning": "\"\u0110\u00f4ng\" l\u00e0 m\u00f9a \u0111\u00f4ng, m\u1ed9t trong b\u1ed1n m\u00f9a t\u1ea1o n\u00ean v\u00f2ng xoay \u0111\u1ea5t tr\u1eddi. Th\u01b0\u1eddng m\u00f9a \u0111\u00f4ng l\u1ea1nh s\u1ebd khi\u1ebfn con ng\u01b0\u1eddi nh\u1edb \u0111\u1ebfn c\u1ea3m gi\u00e1c \u1ea5m \u00e1p, sum v\u1ea7y b\u00ean nh\u1eefng ng\u01b0\u1eddi th\u00e2n y\u00eau, v\u00ec th\u1ebf m\u00f9a \u0111\u00f4ng th\u01b0\u1eddng t\u1ea1o cho con ng\u01b0\u1eddi c\u1ea3m gi\u00e1c nh\u1edb nhung, ch\u1edd \u0111\u1ee3i. T\u00ean \"An\" nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. V\u00ec v\u1eady khi \u0111\u1eb7t t\u00ean \"\u0110\u00f4ng An\" cho con, b\u00f4\u0301 me\u0323 mong mu\u00f4\u0301n con la\u0300 ng\u01b0\u1eddi t\u1ec9nh t\u00e1o, th\u00e1i \u0111\u1ed9 b\u00ecnh t\u0129nh, s\u00e2u s\u1eafc v\u00e0 quan t\u00e2m \u0111\u1ebfn gia \u0111\u00ecnh, l\u00e2\u0301y ch\u01b0\u0303 \"An\" la\u0300m g\u00f4\u0301c \u0111\u00ea\u0309 \u0111\u00f4\u0301i nh\u00e2n x\u01b0\u0309 th\u00ea\u0301.", "sex": 3}
{"first_name": "\u0110\u1ee9c An", "meaning": "\"\u0110\u1ee9c\" t\u1ee9c l\u00e0 ph\u1ea9m h\u1ea1nh, t\u00e1c phong t\u1ed1t \u0111\u1eb9p, quy ph\u1ea1m \u0111\u1ec3 nh\u1eafc nh\u1edf con lu\u00f4n tu\u00e2n theo, ch\u1ec9 chung nh\u1eefng vi\u1ec7c t\u1ed1t l\u00e0nh l\u1ea5y \u0111\u1ea1o \u0111\u1ec3 l\u1eadp th\u00e2n. T\u00ean \"An\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 m\u1ed9t c\u00e1i t\u00ean nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh. \u0110\u1eb7t t\u00ean \"\u0110\u1ee9c An\" cho con b\u1ed1 m\u1eb9 ng\u1ea7m hi v\u1ecdng con s\u1ebd bi\u1ebft c\u00e1ch c\u01b0 x\u1eed c\u00f3 \u0111\u1ea1o \u0111\u1ee9c \u0111\u1ec3 cu\u1ed9c s\u1ed1ng con lu\u00f4n y\u00ean b\u00ecnh, nh\u1eb9 nh\u00e0ng,  s\u1ed1ng c\u00f3 l\u00fd c\u00f3 t\u00ecnh.", "sex": 7}
{"first_name": "Duy An", "meaning": "\"Duy\" ngh\u0129a l\u00e0 s\u1ef1 t\u01b0 duy, suy ngh\u0129 th\u1ea5u \u0111\u00e1o. T\u00ean \"An\" nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. Ng\u01b0\u1eddi t\u00ean \"Duy An\" th\u01b0\u1eddng bi\u1ebft b\u00ecnh t\u0129nh gi\u1ea3i quy\u1ebft v\u1ea5n \u0111\u1ec1 c\u00f3 tr\u00ed tu\u1ec7, th\u00f4ng minh & tinh t\u01b0\u1eddng, lu\u00f4n l\u00e2\u0301y ch\u01b0\u0303 \"An\" la\u0300m g\u00f4\u0301c \u0111\u00ea\u0309 gia\u0309i quy\u00ea\u0301t \u00f4\u0309n tho\u0309a mo\u0323i ti\u0300nh hu\u00f4\u0301ng", "sex": 3}
