{"first_name": "Gia An", "meaning": "\"Gia\" ngh\u0129a l\u00e0 nh\u00e0, gia \u0111\u00ecnh. \"An\" ngh\u0129a l\u00e0 b\u00ecnh an, an to\u00e0n. \u0110\u1eb7t t\u00ean n\u00e0y cho con v\u1edbi mong mu\u1ed1n \u0111\u1ee9a con c\u1ee7a m\u00ecnh s\u1ebd mang l\u1ea1i s\u1ef1 h\u1ea1nh ph\u00fac, \u0111\u1ea7m \u1ea5m, b\u00ecnh y\u00ean cho gia \u0111\u00ecnh.", "sex": 5}
