{"first_name": "H\u1ea3i An", "meaning": "\"H\u1ea3i\" c\u00f3 ngh\u0129a l\u00e0 bi\u1ec3n, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. T\u00ean \"An\" nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. V\u00ec v\u1eady khi \u0111\u1eb7t t\u00ean \"Ha\u0309i An\" cho con, \u0111\u00f3 l\u00e0 l\u00fac b\u00f4\u0301 m\u1eb9 mong mu\u1ed1n con c\u00f3 m\u1ed9t s\u1ed1 m\u1ec7nh may m\u1eafn, tr\u00e1nh m\u1ecdi tai \u01b0\u01a1ng hi\u1ec3m h\u1ecda v\u00e0 lu\u00f4n c\u00f3 s\u1ef1 t\u0129nh l\u1eb7ng c\u1ea7n thi\u1ebft nh\u01b0 vu\u0300ng bi\u00ea\u0309n ph\u0103\u0309ng l\u0103\u0323ng, y\u00ean bi\u0300nh.", "sex": 3}
