{"first_name": "Ho\u00e0i An", "meaning": "T\u00ean \"Ho\u00e0i An\" \u0111\u01b0\u1ee3c gh\u00e9p t\u1eeb ch\u1eef \"Ho\u00e0i\" c\u1ee7a mong c\u1ea7u, \u00f4m \u1ea5p m\u1ed9t n\u1ed7i ni\u1ec1m & \"An\" trong ch\u1eef an nhi\u00ean, b\u00ecnh th\u1ea3n. \"Ho\u00e0i An\" mang \u00fd ngh\u0129a mong m\u1ecfi m\u1ed9t cu\u1ed9c s\u1ed1ng thanh nh\u00e0n, y\u00ean b\u00ecnh, kh\u00f4ng \u00e2u lo, ch\u1eadt v\u1eadt. \"Ho\u00e0i An\" c\u00f2n \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 t\u00e2m t\u00ednh b\u00ecnh d\u1ecb, bi\u1ebft t\u1eadn h\u01b0\u1edfng n\u00e9t \u0111\u1eb9p c\u1ee7a cu\u1ed9c s\u1ed1ng trong s\u1ef1 an nhi\u00ean", "sex": 7}
