{"first_name": "Hu\u1ec7 An", "meaning": "\u201cHu\u1ec7\u201d l\u00e0 tr\u00ed tu\u1ec7, \u00fd ch\u1ec9 th\u00f4ng minh s\u00e1ng su\u1ed1t, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u00f2ng th\u01b0\u01a1ng, l\u00f2ng nh\u00e2n \u00e1i. Khi \u0111i c\u00f9ng v\u1edbi c\u00e1i t\u00ean \"An\" nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh nh\u1eb1m \u00fd ch\u1ec9 con g\u00e1i c\u1ee7a b\u1ed1 m\u1eb9 r\u00e2\u0301t th\u00f4ng minh, \u00f4n h\u00f2a.", "sex": 7}
{"first_name": "H\u01b0\u01a1ng An", "meaning": "\"H\u01b0\u01a1ng\" co\u0301 nghi\u0303a la\u0300 mu\u0300i th\u01a1m. T\u00ean \"An\" nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. \"H\u01b0\u01a1ng An\" la\u0300 ca\u0301i t\u00ean ngo\u0323t nga\u0300o nhe\u0323 nha\u0300ng th\u01b0\u01a1\u0300ng du\u0300ng cho be\u0301 ga\u0301i v\u01a1\u0301i y\u0301 nghi\u0303a con nh\u01b0 la\u0300n h\u01b0\u01a1ng \u00eam \u0111\u00ea\u0300m mang \u0111\u00ea\u0301n cho cu\u00f4\u0323c \u0111\u01a1\u0300i s\u01b0\u0323 bi\u0300nh an, th\u01b0 tha\u0301i, ta\u0323o ca\u0309m gia\u0301c d\u00ea\u0303 chi\u0323u, \u0111\u01b0\u01a1\u0323c mo\u0323i ng\u01b0\u01a1\u0300i y\u00eau m\u00ea\u0301n.", "sex": 5}
{"first_name": "Huy An", "meaning": "\"Huy\" ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng r\u1ef1c r\u1ee1. T\u00ean \"Huy\" th\u1ec3 hi\u1ec7n s\u1ef1 chi\u1ebfu r\u1ecdi c\u1ee7a v\u1ea7ng h\u00e0o quang, cho th\u1ea5y s\u1ef1 k\u1ef3 v\u1ecdng v\u00e0o t\u01b0\u01a1ng lai v\u1ebb vang c\u1ee7a con c\u00e1i. T\u00ean \"An\" nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. L\u00e0 t\u00ean hay \u0111\u01b0\u1ee3c \u0111\u1eb7t cho c\u00e1c b\u00e9 trai, \"Huy An\" c\u00f3 \u00fd ngh\u0129a l\u00e0 s\u00e1ng su\u1ed1t, th\u00f4ng minh, v\u00e0 t\u1ea1o \u0111\u01b0\u1ee3c \u1ea3nh h\u01b0\u1edfng l\u1edbn \u0111\u1ed1i v\u1edbi nh\u1eefng ng\u01b0\u1eddi kh\u00e1c, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau m\u1ebfn, kh\u00e2m ph\u1ee5c, ng\u01b0\u1ee1ng m\u1ed9 nh\u01a1\u0300 va\u0300o \u0111\u01b0\u0301c ti\u0301nh hi\u00ea\u0300n ho\u0300a, l\u00f4\u0301i s\u00f4\u0301ng \u00eam \u0111\u00ea\u0300m cu\u0309a mi\u0300nh.", "sex": 3}
{"first_name": "Huy\u00ea\u0300n An", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Huy\u1ec1n\" c\u00f3 nhi\u1ec1u ngh\u0129a nh\u01b0 d\u00e2y \u0111\u00e0n, d\u00e2y cung, m\u00e0u \u0111en, ch\u1ec9 s\u1ef1 vi\u1ec7c huy\u00ea\u0300n a\u0309o, ky\u0300 di\u00ea\u0323u. \"An\" l\u00e0 t\u00ean nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. Trong c\u00e1ch \u0111\u1eb7t t\u00ean, th\u01b0\u1eddng \"Huy\u1ec1n\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 n\u00e9t \u0111\u1eb9p m\u00ea ho\u1eb7c, k\u1ef3 \u1ea3o nh\u01b0ng thu h\u00fat ta\u0323o n\u00ean ca\u0309m gia\u0301c hi\u00ea\u0301u ky\u0300 nh\u01b0ng thoa\u0309i ma\u0301i.", "sex": 5}
