{"first_name": "Khang An", "meaning": "Khang An trong c\u00e2u \"An khang th\u1ecbnh v\u01b0\u1ee3ng\" l\u00e0 m\u1ed9t c\u00e2u n\u00f3i m\u00e0 m\u1ecdi ng\u01b0\u1eddi hay d\u00f9ng \u0111\u1ec3 c\u1ea7u ch\u00fac cho nhau nh\u00e2n d\u1ecbp \u0111\u1ea7u xu\u00e2n m\u1edbi v\u1edbi \u00fd mong mu\u1ed1n cho gia \u0111\u00ecnh lu\u00f4n \u0111\u01b0\u1ee3c b\u00ecnh an, m\u1ea1nh kho\u1ebb, nh\u00e0 c\u1eeda sung t\u00fac , c\u00f3 nhi\u1ec1u t\u00e0i l\u1ed9c, l\u00e0m \u0103n ng\u00e0y c\u00e0ng kh\u1ea5m kh\u00e1.", "sex": 3}
