{"first_name": "Kh\u01b0\u01a1ng An", "meaning": "N\u1ebfu gh\u00e9p c\u00e1c b\u1ed9 ch\u1eef trong ti\u1ebfng H\u00e1n th\u00ec \"Kh\u01b0\u01a1ng\" c\u00f3 ngh\u0129a chi\u1ebft l\u1ecdc t\u1eeb c\u00e1c b\u1ed9 D\u01b0\u01a1ng l\u00e0 kh\u1ecfe, nhanh nh\u1eb9n nh\u01b0 con s\u01a1n d\u01b0\u01a1ng tr\u00ean n\u00fai, kh\u00f3 kh\u0103n, v\u1ea5t v\u1ea3, kh\u1ed5 s\u1edf \u0111\u1ebfn \u0111\u00e2u c\u0169ng v\u1eabn s\u1ed1ng, v\u1eabn t\u1ed3n t\u1ea1i v\u00e0 ph\u00e1t tri\u1ec3n v\u00e0 t\u1eeb b\u1ed9 V\u01b0\u01a1ng ngh\u0129a l\u00e0 vua, \u00fd ch\u1ec9 ng\u01b0\u1eddi c\u00f3 quy\u1ec1n l\u1ef1c. \u0110\u1eb7t t\u00ean \"Kh\u01b0\u01a1ng An\" cho con, b\u1ed1 m\u1eb9 hi v\u1ecdng con l\u00e0 ng\u01b0\u1eddi c\u00f3 kh\u00ed ti\u1ebft lu\u00f4n v\u1eefng v\u00e0ng tr\u01b0\u1edbc m\u1ecdi phong ba b\u00e3o t\u00e1p; c\u00f3 s\u1ed1 m\u1ec7nh may m\u1eafn, tr\u00e1nh \u0111\u01b0\u1ee3c m\u1ecdi tr\u1eafc tr\u1edf trong cu\u1ed9c s\u1ed1ng.", "sex": 3}
