{"first_name": "Kim An", "meaning": "\"Kim An\" l\u00e0 c\u00e1i t\u00ean ti\u1ebfng Vi\u1ec7t c\u00f3 th\u1ec3 \u0111\u1eb7t cho c\u1ea3 trai v\u00e0 g\u00e1i. V\u1edbi ch\u1eef \"Kim\" thu\u1ed9c nh\u00f3m \u0111\u00e1 qu\u00fd c\u00f3 ngh\u0129a l\u00e0 s\u00e1ng s\u1ee7a, t\u1ecfa s\u00e1ng, s\u00e1ng l\u1ea1n, \"An\" mang ngh\u0129a l\u00e0 an l\u00e0nh, y\u00ean b\u00ecnh th\u00ec t\u00ean \"Kim An\" \u00fd ch\u1ec9 ng\u01b0\u1eddi con c\u00f3 t\u01b0\u01a1ng lai s\u00e1ng l\u1ea1n, r\u1ea1ng ng\u01b0\u1eddi v\u00e0 cu\u1ed9c s\u1ed1ng g\u1eb7p nhi\u1ec1u b\u00ecnh an, may m\u1eafn.", "sex": 7}
{"first_name": "K\u1ef3 An", "meaning": "\"Y\u00ean Ch\u00e2u\" l\u00e0 m\u1ed9t huy\u1ec7n c\u1ee7a t\u1ec9nh S\u01a1n La - l\u00e0 t\u1ec9nh mi\u1ec1n n\u00fai T\u00e2y B\u1eafc Vi\u1ec7t Nam.  Khi sinh ra v\u00e0 l\u1edbn l\u00ean, nhi\u1ec1u ng\u01b0\u1eddi thay \u0111\u1ed5i n\u01a1i sinh s\u1ed1ng. V\u00ec v\u1eady, b\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean theo nguy\u00ean qu\u00e1n cho con v\u1edbi \u00fd ni\u1ec7m t\u01b0\u1edfng nh\u1edb v\u1ec1 qu\u00ea nh\u00e0, ho\u1eb7c c\u00f3 th\u1ec3 \u0111\u00e2y l\u00e0 \u0111\u1ecba \u0111i\u1ec3m g\u1eafn li\u1ec1n", "sex": 5}
