{"first_name": "Long An", "meaning": "\"Long An\" \u0111\u01b0\u1ee3c l\u1ef1a ch\u1ecdn \u0111\u1eb7t t\u00ean cho con, b\u1ed1 m\u1eb9 g\u1eedi g\u1eafm con mang th\u00e2n ph\u1eadn d\u00f2ng d\u00f5i cao qu\u00fd v\u00e0 c\u00f3 s\u1ed1 m\u1ec7nh may m\u1eafn, tr\u00e1nh m\u1ecdi tai \u01b0\u01a1ng hi\u1ec3m h\u1ecda v\u00e0 lu\u00f4n c\u00f3 s\u1ef1 t\u0129nh l\u1eb7ng c\u1ea7n thi\u1ebft. Ngo\u00e0i ra, \"Long An\" l\u00e0 m\u1ed9t t\u1ec9nh c\u1ee7a \u0111\u1ed3ng b\u1eb1ng s\u00f4ng C\u1eedu Long \u0111\u01b0\u1ee3c bi\u1ebft \u0111\u1ebfn nh\u01b0 m\u1ed9t v\u00f9ng qu\u00ea s\u00f4ng n\u01b0\u1edbc h\u1eefu t\u00ecnh, ng\u01b0\u1eddi d\u00e2n ch\u00e2n ch\u1ea5t, hi\u1ec1n h\u00f2a, m\u1ebfn kh\u00e1ch. V\u00ec v\u1eady, c\u00f3 nhi\u1ec1u ng\u01b0\u1eddi \u0111\u1eb7t t\u00ean theo nguy\u00ean qu\u00e1n cho con v\u1edbi \u00fd ni\u1ec7m t\u01b0\u1edfng nh\u1edb v\u1ec1 qu\u00ea nh\u00e0, ho\u1eb7c c\u00f3 th\u1ec3 \u0111\u00e2y l\u00e0 \u0111\u1ecba \u0111i\u1ec3m g\u1eafn li\u1ec1n v\u1edbi t\u00ecnh y\u00eau b\u1ed1 m\u1eb9 ho\u1eb7c ghi d\u1ea5u k\u1ef7 ni\u1ec7m n\u01a1i con sinh ra \u0111\u1eddi.", "sex": 5}
{"first_name": "M\u1ea1nh An", "meaning": "\"Ma\u0323nh\" trong kho\u0309e ma\u0323nh, \"An\" cu\u0309a an l\u00e0nh, y\u00ean b\u00ecnh. Ca\u0301i t\u00ean \"Ma\u0323nh An\" \u0111\u01b0\u01a1\u0323c b\u00f4\u0301 me\u0323 \u0111\u0103\u0323t cho con trai mi\u0300nh v\u1edbi mong \u01b0\u1edbc con co\u0301 th\u00ea\u0309 pha\u0301ch c\u01b0\u01a1\u0300ng tra\u0301ng \u0111\u0103\u0323c thu\u0300 cu\u0309a nam gi\u01a1\u0301i va\u0300 ph\u00e2\u0309m ca\u0301ch cao quy\u0301, y\u0301 chi\u0301 ki\u00ean c\u01b0\u01a1\u0300ng.", "sex": 3}
