{"first_name": "B\u1ea3o \u00c1i", "meaning": "T\u00ean \"\u00c1i\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. \"\u00c1i\" c\u00f2n \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 n\u00f3i v\u1ec1 ng\u01b0\u1eddi ph\u1ee5 n\u1eef c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, \u0111oan trang. \"B\u1ea3o A\u0301i\" l\u00e0 c\u00e1i t\u00ean \u0111\u1eb9p d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i, c\u00f3 ngh\u0129a l\u00e0 v\u1eadt qu\u00fd, v\u1edbi \u00fd ngh\u0129a l\u00e0 con l\u00e0 m\u00f3n qu\u00e0 qu\u00fd gi\u00e1 nh\u1ea5t d\u00e0nh cho b\u00f4\u0301 m\u1eb9.", "sex": 5}
{"first_name": "Di \u00c1i", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"\u00c1i\" c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. \"Di\" l\u00e0 vui v\u1ebb, sung s\u01b0\u1edbng. \"Di A\u0301i\" t\u01b0\u0301c la\u0300 c\u00f4 g\u00e1i xinh \u0111\u1eb9p m\u00e0 cha m\u1eb9 th\u01b0\u01a1ng y\u00eau, h\u00e3nh di\u1ec7n, con s\u1ed1ng l\u00e3ng m\u1ea1n, n\u1eef t\u00ednh.", "sex": 5}
{"first_name": "D\u0129 \u00c1i", "meaning": "D\u0129 \u00c1i l\u00e0 \u0111\u00e1ng y\u00eau, ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i y\u00eau ki\u1ec1u, d\u1ec5 th\u01b0\u01a1ng.", "sex": 5}
{"first_name": "Di\u1ec5m \u00c1i", "meaning": "\"Di\u1ec5m\" \u00fd ch\u1ec9 t\u1ed1t \u0111\u1eb9p, v\u1ebb t\u01b0\u01a1i s\u00e1ng, xinh \u0111\u1eb9p l\u1ed9ng l\u1eaby th\u01b0\u1eddng ng\u1ee5 \u00fd ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p, y\u1ec3u \u0111i\u1ec7u. \"Di\u1ec5m \u00c1i\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean g\u1ee3i n\u00ean s\u1ef1 \u0111\u1eb9p \u0111\u1ebd, ki\u1ec1u di\u1ec5m, l\u1ea1i trong s\u00e1ng, duy\u00ean d\u00e1ng, nh\u1eb9 nh\u00e0ng, \u0111\u00e1ng y\u00eau..", "sex": 5}
{"first_name": "Di\u1ec7u \u00c1i", "meaning": "\"Di\u1ec7u \u00c1i\" l\u00e0 \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, hi\u1ec1n h\u1eadu, c\u1eed ch\u1ec9 di\u1ec7u d\u00e0ng nh\u1eb9 nh\u00e0ng, t\u00e2m t\u00ednh \u0111oan trang, ph\u1ea9m h\u1ea1nh n\u1ebft na", "sex": 5}
{"first_name": "\u0110\u00f4ng \u00c1i", "meaning": "\u0110\u00f4ng ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 ph\u01b0\u01a1ng m\u1eb7t tr\u1eddi m\u1ecdc. \u00c1i ngh\u0129a l\u00e0 y\u00eau th\u00edch, gh\u00e9p th\u00e0nh t\u1eeb \u0110\u00f4ng \u00c1i ngh\u0129a l\u00e0 y\u00eau th\u00edch ph\u01b0\u01a1ng m\u1eb7t tr\u1eddi m\u1ecdc, t\u1ee9c trong s\u00e1ng, tinh anh, r\u1ef1c r\u1ee1.", "sex": 5}
{"first_name": "\u0110\u1ee9c \u00c1i", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\u0110\u1ee9c\" t\u1ee9c l\u00e0 ph\u1ea9m h\u1ea1nh, t\u00e1c phong t\u1ed1t \u0111\u1eb9p, quy ph\u1ea1m m\u00e0 con ng\u01b0\u1eddi ph\u1ea3i tu\u00e2n theo, ch\u1ec9 chung nh\u1eefng vi\u1ec7c t\u1ed1t l\u00e0nh l\u1ea5y \u0111\u1ea1o \u0111\u1ec3 l\u1eadp th\u00e2n.T\u00ean \"\u00c1i\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a.  Ghe\u0301p 2 ch\u01b0\u0303 ta\u0323o tha\u0300nh t\u00ean \"\u0110\u01b0\u0301c \u00c1i\" cho con ha\u0300m y\u0301 b\u00f4\u0301 me\u0323 mong con sau na\u0300y se\u0303 la\u0300 \u0111\u00e2\u0301ng nam nhi s\u00f4\u0301ng \u0111\u01b0\u0301ng \u0111\u0103\u0301n, ngay th\u0103\u0309ng va\u0300 \u0111\u01b0\u0301c \u0111\u00f4\u0323,  \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng.", "sex": 3}
{"first_name": "Gia \u00c1i", "meaning": "\"Gia\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t l\u00e0 lo\u00e0i c\u1ecf lau, mang l\u1ea1i \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p, ph\u00fac l\u00e0nh, l\u00e0 gia \u0111\u00ecnh. \"Gia \u00c1i\" ng\u1ee5 \u00fd con lu\u00f4n nh\u1edb v\u1ec1 gia \u0111\u00ecnh, l\u00e0 m\u00e1i nh\u00e0 n\u01a1i m\u1ecdi ng\u01b0\u1eddi sum v\u1ea7y, sinh ho\u1ea1t b\u00ean nhau, m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng \u0111\u00f9m b\u1ecdc l\u1eabn nhau.", "sex": 5}
{"first_name": "Hi\u1ec3u \u00c1i", "meaning": "Theo ngh\u0129a h\u00e1n Vi\u1ec7t, \"Hi\u1ec3u\" l\u00e0 s\u00e1ng s\u1ee7a, nhi\u1ec1u \u00e1nh s\u00e1ng. \"\u00c1i\" l\u00e0 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi \u0111\u1ee9c h\u1ea1nh, t\u1ed1t \u0111\u1eb9p, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng. \"Hi\u1ec3u \u00c1i\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 t\u00ednh c\u00e1ch h\u00f2a nh\u00e3, t\u1ed1t b\u1ee5ng, lu\u00f4n l\u00e0m ng\u01b0\u1eddi kh\u00e1c vui v\u1ebb, y\u00eau m\u1ebfn.", "sex": 5}
{"first_name": "H\u00f2a \u00c1i", "meaning": "\"H\u00f2a\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 \u00eam \u1ea5m, y\u00ean \u1ed5n th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 v\u1ec1 \u0111\u1ee9c t\u00ednh con ng\u01b0\u1eddi, hi\u1ec1n l\u00e0nh, th\u00e1i \u0111\u1ed9 t\u1eeb t\u1ed1n, m\u1ec1m m\u1ecfng, ng\u00f4n ng\u1eef nh\u1ecf nh\u1eb9, \u00f4n h\u00f2a. T\u00ean \"H\u00f2a \u00c1i\" mang \u00fd ngh\u0129a con s\u1ebd lu\u00f4n may m\u1eafn, d\u00f9ng t\u00ednh kh\u00ed \u00f4n h\u00f2a m\u00e0 c\u1ea3m h\u00f3a l\u00f2ng ng\u01b0\u1eddi.", "sex": 5}
{"first_name": "Ho\u00e0ng \u00c1i", "meaning": "\"Ho\u00e0ng\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi v\u0129 \u0111\u1ea1i, c\u00f3 c\u1ed1t c\u00e1ch v\u01b0\u01a1ng gi\u1ea3, v\u1edbi mong mu\u1ed1n t\u01b0\u01a1ng lai ph\u00fa qu\u00fd, sang gi\u00e0u. T\u00ean \"\u00c1i\" \u0111\u1eb7t cho con v\u1edbi mong mu\u1ed1n con \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng. \"Ho\u00e0ng \u00c1i\"l\u00e0 t\u00ean hay \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con c\u00f3 \u00fd ngh\u0129a l\u00e0 s\u00e1ng su\u1ed1t, th\u00f4ng minh, th\u00e0nh \u0111\u1ea1t, v\u1ebb vang v\u00e0 t\u1ea1o \u0111\u01b0\u1ee3c \u1ea3nh h\u01b0\u1edfng l\u1edbn \u0111\u1ed1i v\u1edbi nh\u1eefng ng\u01b0\u1eddi kh\u00e1c, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau m\u1ebfn, kh\u00e2m ph\u1ee5c, ng\u01b0\u1ee1ng m\u1ed9.", "sex": 5}
{"first_name": "H\u01b0\u0303u \u00c1i", "meaning": "\"H\u01b0\u0303u A\u0301i\" y\u0301 chi\u0309 t\u00ecnh th\u00e2n y\u00eau gi\u1eefa b\u00e8 b\u1ea1n, mong mu\u00f4\u0301n con la\u0300 ng\u01b0\u01a1\u0300i tro\u0323ng ti\u0300nh tro\u0323ng nghi\u0303a, lu\u00f4n \u0111\u01b0\u01a1\u0323c mo\u0323i ng\u01b0\u01a1\u0300i y\u00eau th\u01b0\u01a1ng, quy\u0301 tro\u0323ng.", "sex": 7}
{"first_name": "Kh\u1ea3 \u00c1i", "meaning": "\"Kh\u1ea3 \u00c1i\" l\u00e0 t\u00ean g\u1ecdi \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i c\u00f3 n\u00e9t \u0111\u1eb9p d\u1ecbu d\u00e0ng, m\u1ec1m m\u1ea1i v\u1edbi t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, h\u00f2a nh\u00e3 \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi qu\u00fd m\u1ebfn y\u00eau th\u01b0\u01a1ng. T\u00ean \"Kh\u1ea3 \u00c1i\" h\u00e0m \u00fd mong mu\u1ed1n cho t\u01b0\u01a1ng lai con xinh \u0111\u1eb9p, n\u1ebft na t\u1eeb dung m\u1ea1o \u0111\u1ebfm t\u1ea5m l\u00f2ng", "sex": 5}
{"first_name": "Ki\u00eam \u00c1i", "meaning": "Ki\u00eam \u00c1i th\u01b0\u1eddng \u0111\u01b0\u1ee3c d\u00f9ng ch\u1ec9 th\u00e1i \u0111\u1ed9 y\u00eau th\u01b0\u01a1ng qu\u1ea3ng \u0111\u1ea1i, c\u00f4ng b\u1eb1ng, ch\u00ednh tr\u1ef1c, th\u00e1i \u0111\u1ed9 c\u1ea7u th\u1ecb v\u00e0 khoan dung trong cu\u1ed9c s\u1ed1ng.", "sex": 7}
{"first_name": "Minh \u00c1i", "meaning": "\"Minh\" b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, c\u00f2n c\u00f3 ngh\u0129a ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (b\u00ecnh minh) th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. C\u00e1i t\u00ean \"Minh \u00c1i\" \u00fd ch\u1ec9 ng\u01b0\u1eddi s\u00e1ng l\u00e1ng, th\u00f4ng minh  \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng.", "sex": 5}
{"first_name": "M\u1ef9 \u00c1i", "meaning": "\"M\u1ef9 \u00c1i\" c\u00f3 ngh\u0129a l\u00e0 con l\u00e0 k\u1ebft tinh c\u1ee7a t\u00ecnh y\u00eau cao \u0111\u1eb9p. V\u1edbi \"M\u1ef9 \u00c1i\" cha m\u1eb9 d\u00e0nh cho con s\u1ef1 y\u00eau th\u01b0\u01a1ng, tr\u00e2n tr\u1ecdng t\u1ef1 t\u1ea5m l\u00f2ng", "sex": 5}
{"first_name": "Ng\u1ecdc \u00c1i", "meaning": "\"Ng\u1ecdc \u00c1i\" mang \u00fd ngh\u0129a con l\u00e0 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, \u0111oan trang, ph\u1ea9m h\u1ea1nh n\u1ebft na \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng", "sex": 5}
{"first_name": "Nguy\u00ean \u00c1i", "meaning": "\"Nguy\u00ean\" c\u00f3 ngh\u0129a l\u00e0 tinh kh\u00f4i, \u0111\u1eb9p \u0111\u1ebd, g\u1ee3i l\u00ean \u00fd ngh\u0129a d\u1eabn \u0111\u1ea7u, s\u00e1ng s\u1ee7a, v\u1eefng v\u00e0ng, \u0111i\u1ec1m \u0111\u1ea1m. B\u00ean c\u1ea1nh,  \"\u00c1i\" c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. \u0110\u1eb7t t\u00ean cho con l\u00e0 \"Nguy\u00ean \u00c1i\", b\u1ed1 m\u1eb9 ng\u1ea7m g\u1eedi g\u1eafm \u01b0\u1edbc nguy\u1ec7n mong con c\u00f3 ph\u1ea9m h\u1ea1nh t\u1ed1t \u0111\u1eb9p, cao qu\u00fd v\u00e0 \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng", "sex": 5}
{"first_name": "Nguy\u1ec7t \u00c1i", "meaning": "\"Nguy\u1ec7t\" c\u00f3 ngh\u0129a l\u00e0  tr\u0103ng, \u00e1nh tr\u0103ng, th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 v\u00ed von so s\u00e1nh v\u1edbi v\u1ebb \u0111\u1eb9p c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \"\u00c1i\" \u00fd ch\u1ec9 s\u1ef1 y\u00eau th\u01b0\u01a1ng, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. V\u1edbi t\u00ean \"Nguy\u1ec7t \u00c1i\", b\u1ed1 m\u1eb9 hi v\u1ecdng con s\u1ebd nh\u01b0 v\u1ea7ng tr\u0103ng lu\u00f4n r\u1ef1c r\u1ee1 khi tr\u00f2n, khi khuy\u1ebft  l\u00e0m lay \u0111\u1ed9ng tr\u00e1i tim c\u1ee7a bi\u1ebft bao ng\u01b0\u1eddi, ai c\u0169ng s\u1ebd y\u00eau m\u1ebfn con.", "sex": 5}
{"first_name": "Nh\u00e2n \u00c1i", "meaning": "\"Nh\u00e2n \u00c1i\" l\u00e0 m\u1ed9t t\u1eeb H\u00e1n Vi\u1ec7t \u00fd ch\u1ec9 nh\u00e2n ngh\u0129a l\u00e0m ng\u01b0\u1eddi, con ng\u01b0\u1eddi s\u1ed1ng trong x\u00e3 h\u1ed9i, s\u1ed1ng tr\u00ean tr\u00e1i \u0111\u1ea5t n\u00e0y lu\u00f4n c\u1ea7n c\u00f3 l\u00f2ng y\u00eau th\u01b0\u01a1ng \u0111\u1ed3ng lo\u1ea1i. \u0110\u1eb7t t\u00ean n\u00e0y cho con, b\u1ed1 m\u1eb9 mong mu\u1ed1n con s\u1ebd lu\u00f4n gi\u00fap \u0111\u1ee1 ng\u01b0\u1eddi g\u1eb7p kh\u00f3 kh\u0103n, t\u00edch c\u1ef1c l\u00e0m c\u00e1c vi\u1ec7c t\u1ed1t cho x\u00e3 h\u1ed9i.", "sex": 7}
{"first_name": "Nh\u01a1n \u00c1i", "meaning": "\"Nh\u01a1n \u00c1i\" l\u00e0 m\u1ed9t t\u1eeb H\u00e1n Vi\u1ec7t \u00fd ch\u1ec9 nh\u00e2n ngh\u0129a l\u00e0m ng\u01b0\u1eddi, \u00fd n\u00f3i con ng\u01b0\u1eddi s\u1ed1ng trong x\u00e3 h\u1ed9i, s\u1ed1ng tr\u00ean tr\u00e1i \u0111\u1ea5t n\u00e0y lu\u00f4n c\u1ea7n c\u00f3 l\u00f2ng y\u00eau th\u01b0\u01a1ng \u0111\u1ed3ng lo\u1ea1i. \u0110\u1eb7t t\u00ean n\u00e0y cho con, b\u00f4\u0301 m\u1eb9 mong mu\u1ed1n con s\u1ebd c\u00f3 nh\u1eefng h\u00e0nh \u0111\u1ed9ng nh\u01b0 gi\u00fap \u0111\u1ee1 ng\u01b0\u1eddi g\u1eb7p kh\u00f3 kh\u0103n, t\u00edch c\u1ef1c l\u00e0m c\u00e1c vi\u1ec7c t\u1ed1t cho x\u00e3 h\u1ed9i.", "sex": 5}
{"first_name": "Quang \u00c1i", "meaning": "\"Quang \u00c1i\" c\u00f3 th\u1ec3 hi\u1ec3u l\u00e0 v\u1ebb \u0111\u1eb9p ph\u00fac h\u1eadu, chan h\u00f2a. B\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean \"Quang \u00c1i\" cho con mang \u00fd ngh\u0129a con s\u1ebd lu\u00f4n kh\u00f4i ng\u00f4, t\u00e0i gi\u1ecfi, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng v\u00e0 g\u1eb7p nhi\u1ec1u th\u00e0nh c\u00f4ng trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
{"first_name": "Qu\u1ea3ng \u00c1i", "meaning": "\"Qu\u1ea3ng\" trong ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 qu\u1ea3ng \u0111\u1ea1i, bao qu\u00e1t. K\u1ebft h\u1ee3p v\u1edbi ch\u1eef \"\u00c1i\" c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. T\u00ean \"Qu\u1ea3ng \u00c1i\" ng\u1ee5 \u00fd ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng bao dung, r\u1ed9ng l\u01b0\u1ee3ng, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng.", "sex": 3}
{"first_name": "Qu\u1ed1c \u00c1i", "meaning": "V\u1edbi \"Qu\u1ed1c\": l\u00e0 qu\u1ed1c gia - \u0111\u1ea5t n\u01b0\u1edbc, t\u1ed5 qu\u1ed1c. T\u00ean g\u1ecdi \"Qu\u1ed1c \u00c1i\" th\u1ec3 hi\u1ec7n mong mu\u1ed1n c\u1ee7a cha m\u1eb9 r\u1eb1ng con l\u00e0 ng\u01b0\u1eddi bi\u1ebft y\u00eau th\u01b0\u01a1ng m\u1ecdi ng\u01b0\u1eddi, trung th\u00e0nh v\u1edbi \u0111\u1ea5t n\u01b0\u1edbc.", "sex": 3}
{"first_name": "Thanh \u00c1i", "meaning": "\"Thanh\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 trong s\u1ea1ch, li\u00eam khi\u1ebft.  \"\u00c1i\" c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. \"Thanh \u00c1i\" mang \u00fd ngh\u0129a ng\u01b0\u1eddi c\u00f3 t\u00e2m \u0111\u1ee9c h\u1ea1nh, t\u1eeb bi, tr\u00ed tu\u1ec7,  ph\u1ea9m h\u1ea1nh t\u1ed1t \u0111\u1eb9p, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng", "sex": 3}
{"first_name": "Thi\u00ean \u00c1i", "meaning": "\"Thi\u00ean\" trong ti\u1ebfng H\u00e1n Vi\u1ec7t Thi\u00ean c\u00f3 ngh\u0129a l\u00e0 tr\u1eddi. T\u00ean \"\u00c1i\" c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. T\u00ean \"Thi\u00ean \u00c1i\" mang \u00fd ngh\u0129a sau n\u00e0y con s\u1ebd th\u00f4ng minh, xu\u1ea5t ch\u00fang, l\u00e0 t\u1ea5m g\u01b0\u01a1ng s\u00e1ng \u0111\u1ec3 m\u1ecdi ng\u01b0\u1eddi noi theo, \u0111\u01b0\u01a1\u0323c mo\u0323i ng\u01b0\u01a1\u0300i y\u00eau th\u01b0\u01a1ng, quy\u0301 tro\u0323ng.", "sex": 3}
{"first_name": "Thi\u1ec7n \u00c1i", "meaning": "\"Thi\u1ec7n\" th\u01b0\u01a1\u0300ng du\u0300ng \u0111\u00ea\u0309 chi\u0309 l\u00e0 ng\u01b0\u1eddi t\u1ed1t, c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, th\u1ec3 hi\u1ec7n t\u00ecnh th\u01b0\u01a1ng bao la b\u00e1c \u00e1i, th\u01b0\u01a1ng ng\u01b0\u1eddi. T\u00ean \"\u00c1i\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. \"Thi\u1ec7n A\u0301i\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean hay v\u00e0 \u00fd ngh\u0129a, \u1ea9n ch\u1ee9a mong mu\u1ed1n, k\u1ef3 v\u1ecdng c\u1ee7a cha m\u1eb9 v\u00e0o \u0111\u1ee9a con y\u00eau qu\u00fd.", "sex": 5}
{"first_name": "Thu\u1eadn \u00c1i", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thu\u1eadn\" c\u00f3 ngh\u0129a l\u00e0 noi theo, hay l\u00e0m theo \u0111\u00fang quy lu\u1eadt, l\u00e0 h\u00f2a thu\u1eadn, hi\u1ebfu thu\u1eadn. \"\u00c1i\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. \u0110\u0103\u0323t t\u00ean con la\u0300 \"Thu\u00e2\u0323n \u00c1i\", b\u00f4\u0301 me\u0323 mong con s\u1ebd ngoan ngo\u00e3n, bi\u1ebft v\u00e2ng l\u1eddi, hi\u1ebfu th\u1ea3o v\u1edbi \u00f4ng b\u00e0, cha m\u1eb9, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng.", "sex": 3}
{"first_name": "Th\u00fay \u00c1i", "meaning": "\"Th\u00fay \u00c1i\" ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p, dung m\u1ea1o hi\u1ec1n h\u00f2a, t\u00e2m t\u00ednh s\u00e2u s\u1eafc, \u0111oan trang, bi\u1ebft suy s\u00e9t & c\u00f3 l\u00f2ng nh\u00e2n", "sex": 5}
{"first_name": "Th\u00f9y \u00c1i", "meaning": "Theo t\u1eeb \u0111i\u1ec3n Ti\u1ebfng Vi\u1ec7t, \"Th\u00f9y\" c\u00f3 ngh\u0129a l\u00e0 th\u00f9y m\u1ecb, n\u1ebft na, \u0111\u1eb1m th\u1eafm.  \"\u00c1i\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con lu\u00f4n xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, \u0111\u00e1ng y\u00eau. V\u1edbi t\u00ean \"Th\u00f9y \u00c1i\" ba m\u1eb9 mong con n\u1ebft na th\u00f9y m\u1ecb,c\u00f3 cu\u1ed9c s\u1ed1ng an nh\u00e0n,h\u1ea1nh ph\u00fac.", "sex": 5}
{"first_name": "Th\u1ee7y \u00c1i", "meaning": "\"Thu\u0309y\" l\u00e0 n\u01b0\u1edbc, m\u1ed9t trong nh\u1eefng y\u1ebfu t\u1ed1 kh\u00f4ng th\u1ec3 thi\u1ebfu trong \u0111\u1eddi s\u1ed1ng con ng\u01b0\u1eddi. N\u01b0\u1edbc c\u00f3 l\u00fac t\u0129nh l\u1eb7ng, th\u00e2m r\u1ea7m, nh\u01b0ng c\u0169ng c\u00f3 khi d\u1eef d\u1ed9i m\u00e3nh li\u1ec7t. Th\u00ea\u0301 nh\u01b0ng khi k\u00ea\u0301t h\u01a1\u0323p v\u01a1\u0301i t\u01b0\u0300  \"\u00c1i\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 y\u00eau, s\u1ef1 l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a thi\u0300 t\u00ean \"Thu\u0309y \u00c1i\" th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, \u0111oan trang v\u00e0 ph\u1ea9m h\u1ea1nh n\u1ebft na n\u01a1i con \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng.", "sex": 5}
{"first_name": "Thy \u00c1i", "meaning": "T\u00ean \"\u00c1i\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. \"Thy A\u0301i\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean nh\u1eb9 nh\u00e0ng, \u0111\u01b0\u1ee3c g\u1eedi g\u1eafm v\u1edbi \u00fd ngh\u0129a v\u1ec1 m\u1ed9t cu\u1ed9c s\u1ed1ng thanh tao c\u1ee7a m\u1ed9t con ng\u01b0\u1eddi th\u00f4ng minh t\u00e0i gi\u1ecfi \u0111\u01b0\u01a1\u0323c nhi\u00ea\u0300u ng\u01b0\u01a1\u0300i y\u00eau m\u00ea\u0301n.", "sex": 5}
{"first_name": "Tr\u1ecdng \u00c1i", "meaning": "\"Tr\u1ecdng\" theo nghi\u0303a Ha\u0301n - Vi\u00ea\u0323t l\u00e0 ng\u01b0\u1eddi bi\u1ebft qu\u00fd tr\u1ecdng l\u1ebd ph\u1ea3i, s\u1ed1ng \u0111\u1ea1o l\u00fd, \u0111\u1ee9ng \u0111\u1eafn, lu\u00f4n ch\u1ecdn con \u0111\u01b0\u1eddng ngay th\u1eb3ng.\"\u00c1i\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. V\u00ec v\u1eady, t\u00ean \"Tr\u1ecdng \u00c1i\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 c\u1ed1t c\u00e1ch thanh cao, bi\u1ebft ph\u00e2n \u0111\u1ecbnh r\u1ea1ch r\u00f2i, s\u1ed1ng c\u00f3 \u0111\u1ea1o l\u00fd, c\u00f3 t\u00ecnh ngh\u0129a, c\u00f3 t\u1ea5m l\u00f2ng bao dung, \u0111\u1ed9 l\u01b0\u1ee3ng \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng", "sex": 3}
{"first_name": "Tu\u1ec7 \u00c1i", "meaning": "\u0110\u00e2y l\u00e0 t\u00ean hay c\u00f3 th\u1ec3 d\u00f9ng cho c\u1ea3 con trai v\u00e0 con g\u00e1i v\u1edbi \"Tu\u1ec7\" ngh\u0129a l\u00e0 tr\u00ed th\u00f4ng minh, tr\u00ed tu\u1ec7.\"\u00c1i\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. B\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean \"Thu\u1eadn \u00c1i\" cho con v\u1edbi mong mu\u1ed1n \u0111\u1ee9a tr\u1ebb sinh ra s\u1ebd l\u00e0 m\u1ed9t ng\u01b0\u1eddi bi\u1ebft \u0111i\u1ec1u, ph\u1ea9m h\u1ea1nh cao qu\u00fd, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng.", "sex": 7}
{"first_name": "Vi\u1ec7t \u00c1i", "meaning": "T\u00ean \"Vi\u1ec7t\" xu\u1ea5t ph\u00e1t t\u1eeb t\u00ean c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, c\u0169ng c\u00f3 n\u00e9t ngh\u0129a ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi th\u00f4ng minh, \u01b0u vi\u1ec7t. T\u00ean \"\u00c1i\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. \"Vi\u00ea\u0323t A\u0301i\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c g\u1eedi g\u1eafm v\u1edbi \u00fd ngh\u0129a v\u1ec1 cu\u1ed9c s\u1ed1ng c\u1ee7a m\u1ed9t ch\u00e0ng trai m\u1ea1nh m\u1ebd, \u01b0u t\u00fa.", "sex": 3}
{"first_name": "V\u0129nh \u00c1i", "meaning": "T\u00ean \"V\u0129nh\" mang \u00fd ngh\u0129a tr\u01b0\u1eddng t\u1ed3n, v\u0129nh vi\u1ec5n. T\u00ean \"\u00c1i\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. V\u00ec v\u1eady t\u00ean T\u00ean \"Vi\u1ec7t\" xu\u1ea5t ph\u00e1t t\u1eeb t\u00ean c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, c\u0169ng c\u00f3 n\u00e9t ngh\u0129a ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi th\u00f4ng minh, \u01b0u vi\u1ec7t. T\u00ean \"\u00c1i\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. \"Vi\u00ea\u0323t A\u0301i\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c g\u1eedi g\u1eafm v\u1edbi \u00fd ngh\u0129a v\u1ec1 cu\u1ed9c s\u1ed1ng c\u1ee7a m\u1ed9t ch\u00e0ng trai m\u1ea1nh m\u1ebd, \u01b0u t\u00fa. V\u00ec v\u1eady t\u00ean \"Vi\u0303nh \u00c1i\" \u0111\u1eb7t cho con th\u1ec3 hi\u1ec7n ni\u00ea\u0300m h vo\u0323ng cu\u0309a b\u00f4\u0301 me\u0323 con lu\u00f4n \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng", "sex": 3}
{"first_name": "V\u01b0\u01a1ng \u00c1i", "meaning": "\"V\u01b0\u01a1ng\" l\u00e0 t\u00ean th\u01b0\u1eddng \u0111\u1eb7t cho con trai y\u0301 chi\u0309 con nha\u0300 v\u01b0\u01a1ng gia\u0309, danh gia\u0301. T\u00ean \"\u00c1i\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. \u0110\u0103t t\u00ean con la\u0300 \"V\u01b0\u01a1ng \u00c1i\" b\u00f4\u0301 me\u0323 v\u00ed cu\u1ed9c s\u1ed1ng c\u1ee7a con s\u1ebd gi\u00e0u sang, huy ho\u00e0ng nh\u01b0 m\u1ed9t v\u1ecb vua c\u0169ng nh\u01b0 lu\u00f4n \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi th\u01b0\u01a1ng y\u00eau qu\u00fd tr\u1ecdng.", "sex": 3}
{"first_name": "Vy \u00c1i", "meaning": "Ch\u01b0\u0303 \"Vy\" th\u01b0\u01a1\u0300ng chi\u0309 m\u00f4\u0323t loa\u0300i hoa t\u01b0\u01a1\u0323ng tr\u01b0ng cho c\u00f4 g\u00e1i xinh x\u1eafn, nh\u1ecf b\u00e9 nh\u01b0ng c\u0169ng r\u1ea5t gi\u00e0u s\u1ee9c s\u1ed1ng. T\u00ean \"\u00c1i\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. \"Vy \u00c1i\" ngoa\u0300i y\u0301 chi\u0309 loa\u0300i hoa nho\u0309 be\u0301 \u0111\u01b0\u01a1\u0323c mo\u0323i ng\u01b0\u01a1\u0300i y\u00eau m\u00ea\u0301n  c\u00f2n \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 n\u00f3i v\u1ec1 ng\u01b0\u1eddi ph\u1ee5 n\u1eef c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, \u0111oan trang.", "sex": 5}
{"first_name": "Xu\u00e2n \u00c1i", "meaning": "\"Xu\u00e2n\" l\u00e0 m\u00f9a xu\u00e2n, l\u00e0 m\u00f9a c\u1ee7a c\u00e2y c\u1ed1i \u0111\u00e2m ch\u1ed3i, n\u1ea3y l\u1ed9c, sinh s\u00f4i ph\u00e1t tri\u1ec3n. S\u00e1nh c\u00f9ng t\u00ean  \"\u00c1i\" c\u00f3 ngh\u0129a y\u00eau th\u01b0\u01a1ng, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng. \"Xu\u00e2n \u00c1i\" l\u00e0 t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i v\u1edbi mong mu\u1ed1n con lu\u00f4n xinh \u0111\u1eb9p, tr\u00e0n tr\u1ec1 s\u1ee9c s\u1ed1ng, vui v\u1ebb v\u00e0 lu\u00f4n \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng.", "sex": 5}
{"first_name": "B\u1ea3o \u1ea4n", "meaning": "B\u1ea3o l\u00e0 qu\u00fd gi\u00e1, t\u00f4n tr\u1ecdng. B\u1ea3o \u1ea4n hi\u1ec3u tr\u1ef1c ti\u1ebfp l\u00e0 c\u00e1i tri\u1ec7n qu\u00fd, h\u00e0m ngh\u0129a 1 th\u00e0nh qu\u1ea3 gi\u00e1 tr\u1ecb, \u0111\u01b0\u1ee3c tr\u00e2n tr\u1ecdng, c\u1ea7n \u0111\u01b0\u1ee3c b\u1ea3o v\u1ec7, gi\u1eef g\u00ecn.", "sex": 3}
