{"first_name": "\u0110\u1ea1i \u1ea4n", "meaning": "\u0110\u1ea1i l\u00e0 l\u1edbn. \u0110\u1ea1i \u1ea4n l\u00e0 tri\u1ec7n l\u1edbn, ch\u1ec9 v\u00e0o con ng\u01b0\u1eddi c\u00f3 v\u1ecb tr\u00ed quan tr\u1ecdng, ph\u1ea9m c\u00e1ch cao qu\u00fd", "sex": 3}
