{"first_name": "Di\u1ec5m \u00c2n", "meaning": "\"Di\u1ec5m\" l\u00e0 t\u1eeb ch\u1ec9 v\u1ebb \u0111\u1eb9p c\u1ee7a ng\u01b0\u1eddi con g\u00e1i, \u00fd n\u00f3i v\u1ebb \u0111\u1eb9p cao sang, quy\u1ec1n qu\u00fd to\u00e1t ra ngo\u00e0i m\u00e0 khi\u1ebfn ta nh\u00ecn v\u00e0o ph\u1ea3i tr\u1ea7m tr\u1ed3, th\u00e1n ph\u1ee5c. \"\u00c2n\" c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 chu \u0111\u00e1o, t\u1ec9 m\u1ec9 hay c\u00f2n th\u1ec3 hi\u1ec7n s\u1ef1 mang \u01a1n s\u00e2u s\u1eafc tha thi\u1ebft. \u0110\u1eb7t t\u00ean \"Di\u1ec5m \u00c2n\" cho con, b\u1ed1 m\u1eb9 nh\u01b0 th\u1ea7m c\u1ea3m \u01a1n t\u1ea1o h\u00f3a \u0111\u00e3 ban cho m\u00ecnh m\u1ed9t \u0111\u1eb7c \u00e2n \u0111\u1eb9p \u0111\u1ebd, qu\u00fd gi\u00e1.", "sex": 5}
{"first_name": "Di\u1ec7u \u00c2n", "meaning": "Di\u1ec7u l\u00e0 k\u1ef3 \u1ea3o, k\u1ef3 b\u00ed. Di\u1ec7u \u00c2n l\u00e0 \u00e2n \u0111\u1ee9c b\u1ea5t ng\u1edd, k\u1ef3 \u1ea3o, th\u1ec3 hi\u1ec7n ni\u1ec1m mong \u0111\u1ee3i lu\u00f4n c\u00f3 nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p, may m\u1eafn \u0111\u1ebfn b\u1ea5t ng\u1edd cho con.", "sex": 5}
{"first_name": "\u0110\u1ed3ng \u00c2n", "meaning": "\u0110\u1ed3ng l\u00e0 c\u00f9ng nhau. \u0110\u1ed3ng \u00c2n l\u00e0 \u01a1n \u0111\u1ee9c b\u00ean nhau, c\u00f9ng ng\u01b0\u1eddi l\u00e0m n\u00ean c\u00e1i t\u1ed1t \u0111\u1eb9p, s\u1ef1 th\u00e0nh c\u00f4ng, th\u1ec3 hi\u1ec7n mong \u0111\u1ee3i 1 con ng\u01b0\u1eddi c\u00f3 t\u1ed1 ch\u1ea5t h\u1ee3p t\u00e1c, c\u00f9ng m\u1ecdi ng\u01b0\u1eddi gi\u1eef tr\u00e1ch nhi\u1ec7m v\u1edbi nhau.", "sex": 7}
{"first_name": "\u0110\u1ee9c \u00c2n", "meaning": "\"\u0110\u1ee9c \u00c2n\" ngh\u0129a l\u00e0 t\u00e2m t\u1eeb bi, l\u00e0 kh\u1ea3 n\u0103ng d\u1ecbu d\u00e0ng, tha th\u1ee9, ch\u1ea5p nh\u1eadn v\u00e0 che ch\u1edf ng\u01b0\u1eddi kh\u00e1c v\u1edbi t\u00ecnh th\u01b0\u01a1ng.", "sex": 3}
{"first_name": "Duy \u00c2n", "meaning": "Duy l\u00e0 duy nh\u1ea5t. Duy \u00c2n l\u00e0 \u01a1n ngh\u0129a duy nh\u1ea5t, ch\u1ec9 ng\u01b0\u1eddi trung t\u00edn, ngh\u0129a t\u00ecnh", "sex": 3}
{"first_name": "Duy\u00ean \u00c2n", "meaning": "Duy\u00ean l\u00e0 ph\u1eadn s\u1ed1. Duy\u00ean \u00c2n l\u00e0 \u00e2n \u0111\u1ee9c, duy\u00ean ph\u1eadn, h\u00e0m \u00fd ng\u01b0\u1eddi ch\u00ed t\u00ecnh, ch\u00ed ngh\u0129a", "sex": 5}
{"first_name": "H\u00e0 \u00c2n", "meaning": "H\u00e0 l\u00e0 hoa sen. H\u00e0 \u00c2n l\u00e0 \u00e2n \u0111\u1ee9c nh\u01b0 hoa sen, ch\u1ec9 v\u00e0o ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p k\u00edn \u0111\u00e1o, ng\u1ecdc khi\u1ebft b\u0103ng thanh.", "sex": 5}
{"first_name": "H\u1ea1 \u00c2n", "meaning": "H\u1ea1 l\u00e0 ch\u00fac m\u1eebng, t\u1ed1t l\u00e0nh, \u0111i\u1ec1m vui v\u1ebb. H\u1ea1 \u00c2n l\u00e0 \u01a1n \u0111\u1ee9c vui v\u1ebb, sung s\u01b0\u1edbng, nh\u1eadn \u0111\u01b0\u1ee3c s\u1ef1 ph\u00f9 tr\u1ee3 b\u1ea3o b\u1ecdc c\u1ee7a t\u1ed5 ti\u00ean, su\u1ed1t \u0111\u1eddi an l\u1ea1c, h\u1ea1nh ph\u00fac.", "sex": 5}
{"first_name": "Ho\u00e0i \u00c2n", "meaning": "\"Ho\u00e0i\" c\u00f3 ngh\u0129a l\u00e0 v\u01b0\u01a1ng v\u1ea5n, nh\u1edb nhung, l\u01b0u luy\u1ebfn. \"\u00c2n\" l\u00e0 \u00e2n hu\u1ec7. \u0110\u1eb7t t\u00ean \"Ho\u00e0i \u00c2n\" cho con h\u00e0m \u00fd b\u1ed1 m\u1eb9  c\u00f2n v\u01b0\u01a1ng v\u1ea5n m\u00e3i c\u1ea3m gi\u00e1c nh\u1edb nhung, l\u01b0u luy\u1ebfn m\u00e3i \u01a1n ngh\u0129a n\u00e0o \u0111\u00f3.", "sex": 5}
{"first_name": "H\u1ed3ng \u00c2n", "meaning": "\"H\u1ed3ng \u00c2n\" ngh\u0129a l\u00e0 m\u1ed9t vi\u00ean ng\u1ecdc s\u00e1ng, lu\u00f4n chi\u1ebfu s\u00e1ng v\u00e0 gi\u00fap \u0111\u1ee1 ng\u01b0\u1eddi kh\u00e1c, l\u00e0 ng\u01b0\u1eddi c\u00f3 nhi\u1ec1u c\u00f4ng \u0111\u1ee9c. \"H\u1ed3ng \u00c2n\" l\u00e0 h\u00ecnh \u1ea3nh c\u1ee7a cu\u1ed9c s\u1ed1ng th\u01b0 nh\u00e0n,b\u00ecnh y\u00ean nh\u01b0ng r\u1ea5t th\u1ecbnh v\u01b0\u1ee3ng v\u00e0 \u0111\u1ea7y \u0111\u1ee7. Khi ch\u1ecdn t\u00ean cho con l\u00e0 \"H\u1ed3ng \u00c2n\", b\u1ed1 m\u1eb9 c\u00f2n ng\u1ee5 \u00fd r\u1eb1ng con s\u1ebd l\u00e0 ng\u01b0\u1eddi bi\u1ebft gi\u00fap \u0111\u1ee1 ng\u01b0\u1eddi kh\u00e1c.", "sex": 7}
{"first_name": "Hu\u1ec7 \u00c2n", "meaning": "\u0110i c\u00f9ng ch\u1eef \u201cHu\u1ec7\u201d \u00fd ch\u1ec9 th\u00f4ng minh s\u00e1ng su\u1ed1t c\u00f2n c\u00f3 ch\u1eef \"\u00c2n\" ngh\u0129a l\u00e0 l\u00f2ng th\u01b0\u01a1ng, l\u00f2ng nh\u00e2n \u00e1i. Con \u0111\u1ebfn v\u1edbi b\u1ed1 m\u1eb9 nh\u01b0 m\u1ed9t \u0111i\u1ec1u \u01a1n \u0111\u01b0\u0301c v\u01a1\u0301i l\u00f2ng th\u01b0\u01a1ng v\u00f4 v\u00e0n.", "sex": 7}
{"first_name": "H\u1eefu \u00c2n", "meaning": "\"\u00c2n\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t tr\u1ea1ng th\u00e1i t\u00ecnh c\u1ea3m \u0111\u1eb9p \u0111\u1ebd c\u1ee7a con ng\u01b0\u1eddi, \"\u00c2n\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 chu \u0111\u00e1o, t\u1ec9 m\u1ec9 hay c\u00f2n th\u1ec3 hi\u1ec7n s\u1ef1 mang \u01a1n s\u00e2u s\u1eafc tha thi\u1ebft. V\u00ec v\u1eady, t\u00ean \"H\u01b0\u0303u \u00c2n\" d\u00f9ng \u0111\u1ec3 \u0111\u0103\u0323t t\u00ean cho con trai y\u00eau cu\u0309a mi\u0300nh v\u01a1\u0301i ni\u00ea\u0300m mong \u01b0\u01a1\u0301c khi l\u01a1\u0301n l\u00ean con se\u0303 tr\u01a1\u0309 tha\u0300nh ng\u01b0\u01a1\u0300i s\u00f4\u0301ng co\u0301 ly\u0301 co\u0301 ti\u0300nh, bi\u00ea\u0301t kh\u0103\u0301c ghi \u00e2n nghi\u0303a ng\u01b0\u01a1\u0300i kha\u0301c mang \u0111\u00ea\u0301n.", "sex": 3}
{"first_name": "Huy\u1ec1n \u00c2n", "meaning": "Huy\u1ec1n l\u00e0 b\u00f3ng \u0111\u00eam, s\u1ef1 k\u1ef3 di\u1ec7u b\u1ea5t ng\u1edd. Huy\u1ec1n \u00c2n h\u00e0m ngh\u0129a cu\u1ed9c \u0111\u1eddi s\u1ebd lu\u00f4n g\u1eb7p nh\u1eefng \u01a1n \u0111\u1ee9c b\u1ea5t ng\u1edd, \u0111\u1eb9p \u0111\u1ebd t\u1eeb t\u1ed5 ti\u00ean th\u1ea7n th\u00e1nh, lu\u00f4n c\u00f3 \u0111\u01b0\u1ee3c s\u1ef1 may m\u1eafn v\u01b0\u1ee3t tr\u1ed9i.", "sex": 5}
{"first_name": "Kh\u1ea3i \u00c2n", "meaning": "Kh\u1ea3i l\u00e0 vui v\u1ebb, m\u1eebng r\u1ee1. Kh\u1ea3i \u00c2n l\u00e0 nh\u1eadn \u0111\u01b0\u1ee3c \u01a1n \u0111\u1ee9c, l\u1ea1c quan, ph\u1ea5n ch\u1ea5n, vui v\u1ebb, may m\u1eafn trong cu\u1ed9c \u0111\u1eddi.", "sex": 3}
{"first_name": "Kh\u00e1nh \u00c2n", "meaning": "\"Kh\u00e1nh \u00c2n\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean hay v\u1edbi \u00fd ngh\u0129a l\u00e0 s\u1ef1 c\u00f3 m\u1eb7t c\u1ee7a con l\u00e0 \u0111\u1eb7c \u00e2n, h\u1ef7 s\u1ef1 t\u1eeb tr\u1eddi cao. \u0110\u1eb7t t\u00ean n\u00e0y cho con b\u1ed1 m\u1eb9 c\u0169ng ng\u1ee5 \u00fd mong cho con s\u1ef1 y\u00ean b\u00ecnh v\u1edbi mong mu\u1ed1n cu\u1ed9c \u0111\u1eddi con s\u1ebd g\u1eb7p \u00edt ch\u00f4ng gai, b\u00ecnh y\u00ean v\u00e0 h\u1ea1nh ph\u00fac.", "sex": 7}
{"first_name": "K\u1ef3 \u00c2n", "meaning": "K\u1ef3 l\u00e0 l\u1ea1 l\u00f9ng, hi\u1ebfm c\u00f3, ng\u1ea1c nhi\u00ean. K\u1ef3 \u00c2n l\u00e0 \u0111\u01b0\u1ee3c ban \u01a1n \u0111\u1ee9c k\u1ef3 l\u1ea1, th\u1ec3 hi\u1ec7n mong m\u1ecfi cha m\u1eb9 mu\u1ed1n con c\u00e1i may m\u1eafn, c\u00f3 nh\u1eefng th\u00e0nh t\u00edch b\u1ea5t ng\u1edd trong \u0111\u1eddi, \u0111\u01b0\u1ee3c ph\u00f9 tr\u1ee3 may m\u1eafn, th\u00e0nh c\u00f4ng.", "sex": 3}
{"first_name": "Linh \u00c2n", "meaning": "\"Linh\" t\u01b0\u0301c linh thi\u00eang, mang \u00fd ngh\u0129a t\u00f4n k\u00ednh v\u1ec1 m\u1eb7t t\u00e2m linh, \u00fd n\u00f3i c\u1ea7u \u0111\u01b0\u1ee3c \u01b0\u1edbc th\u1ea5y. \"\u00c2n\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t tr\u1ea1ng th\u00e1i t\u00ecnh c\u1ea3m \u0111\u1eb9p \u0111\u1ebd c\u1ee7a con ng\u01b0\u1eddi, \"\u00c2n\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 chu \u0111\u00e1o, t\u1ec9 m\u1ec9 hay c\u00f2n th\u1ec3 hi\u1ec7n s\u1ef1 mang \u01a1n s\u00e2u s\u1eafc tha thi\u1ebft. V\u00ec v\u1eady, t\u00ean \"Linh \u00c2n\" ng\u00e2\u0300m y\u0301 con chi\u0301nh la\u0300 \u00e2n hu\u00ea\u0323 to l\u01a1\u0301n ma\u0300 b\u00f4\u0301 me\u0323 h\u0103\u0300ng mong b\u00e2\u0301y l\u00e2u nay.", "sex": 5}
{"first_name": "Minh \u00c2n", "meaning": "\"Minh\" c\u00f3 ngh\u0129a l\u00e0 chi\u1ebfu s\u00e1ng, s\u00e1ng r\u1ef1c r\u1ee1, s\u00e1ng ch\u00f3i. \"\u00c2n\" l\u00e0 \u01a1n ngh\u0129a, t\u00ecnh ngh\u0129a, t\u00ecnh c\u1ea3m, ch\u1ec9 ng\u01b0\u1eddi c\u00f3 \u01a1n \u0111\u1ee9c, ng\u01b0\u1eddi c\u00f3 c\u00f4ng. \"\u00c2n\" c\u0169ng c\u00f3 ngh\u0129a l\u00e0 to l\u1edbn, th\u1ecbnh v\u01b0\u1ee3ng, \u0111\u1ea7y \u0111\u1ee7, \u0111\u00f4ng \u0111\u00fac v\u00e0 phong ph\u00fa, s\u00e2u s\u1eafc v\u00e0 n\u1ed3ng h\u1eadu. \"Minh \u00c2n\" ng\u1ee5 \u00fd r\u1eb1ng con s\u1ebd s\u1eb5n s\u00e0ng c\u1ed1ng hi\u1ebfn cho \u0111\u1eddi t\u1ea5t c\u1ea3 nh\u1eefng g\u00ec m\u00ecnh c\u00f3, s\u1ee9c l\u1ef1c v\u00e0 tr\u00ed tu\u1ec7, v\u1edbi m\u1ed9t tinh th\u1ea7n s\u00e2u s\u1eafc v\u00e0 tr\u00e1i tim n\u1ed3ng h\u1eadu.", "sex": 7}
{"first_name": "Ng\u1ecdc \u00c2n", "meaning": "Con ch\u00ednh l\u00e0 \u01a1n hu\u1ec7 qu\u00fd gi\u00e1 tr\u1eddi ban cho b\u1ed1 m\u1eb9. Ngo\u00e0i ra, \u0111\u1eb7t t\u00ean \"Ng\u1ecdc \u00c2n\" cho con, b\u1ed1 m\u1eb9 ng\u1ea7m hi v\u1ecdng con s\u1ebd l\u00e0 ng\u01b0\u1eddi c\u00f3 t\u00ednh c\u00e1ch t\u1ed1t \u0111\u1eb9p, cao qu\u00fd nh\u01b0 ng\u1ecdc ng\u00e0, ch\u00e2u b\u00e1u.", "sex": 7}
{"first_name": "Nguy\u00ean \u00c2n", "meaning": "Nguy\u00ean l\u00e0 tr\u1ecdn v\u1eb9n, kh\u1edfi \u0111\u1ea7u \u0111\u1ea7y \u0111\u1ee7. Nguy\u00ean \u00c2n l\u00e0 mong \u01b0\u1edbc lu\u00f4n c\u00f3 \u0111\u01b0\u1ee3c \u01a1n \u0111\u1ee9c cao qu\u00fd, \u0111\u1ea7y \u0111\u1ee7, tr\u1ecdn v\u1eb9n trong cu\u1ed9c \u0111\u1eddi.", "sex": 3}
{"first_name": "Nguy\u1ec7t \u00c2n", "meaning": "Nguy\u1ec7t l\u00e0 m\u1eb7t tr\u0103ng. Nguy\u1ec7t \u00c2n ch\u1ec9 v\u00e0o ng\u01b0\u1eddi con g\u00e1i d\u1ecbu d\u00e0ng, nhu thu\u1eadn, mang l\u1ea1i t\u00ecnh c\u1ea3m s\u00e2u s\u1eafc", "sex": 5}
{"first_name": "Ph\u00fa \u00c2n", "meaning": "\"Ph\u00fa\" ngh\u0129a l\u00e0 \u0111\u01b0\u1ee3c cho, \u0111\u01b0\u1ee3c ban ph\u00e1t. \"\u00c2n\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t tr\u1ea1ng th\u00e1i t\u00ecnh c\u1ea3m \u0111\u1eb9p \u0111\u1ebd c\u1ee7a con ng\u01b0\u1eddi, \"\u00c2n\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 chu \u0111\u00e1o, t\u1ec9 m\u1ec9 hay c\u00f2n th\u1ec3 hi\u1ec7n s\u1ef1 mang \u01a1n s\u00e2u s\u1eafc tha thi\u1ebft. \"Ph\u00fa \u00c2n\" th\u01b0\u1eddng d\u00f9ng \u0111\u1eb7t t\u00ean cho b\u00e9 trai y\u0301 chi\u0309 con l\u00e0 \u0111\u01b0\u1ee3c tr\u1eddi ban cho, nh\u1eefng t\u01b0 ch\u1ea5t v\u1ed1n c\u00f3 ngay t\u1eeb l\u00fac sinh ra, nh\u01b0 \u0111\u01b0\u1ee3c tr\u1eddi ph\u00fa.", "sex": 3}
{"first_name": "Ph\u00fac \u00c2n", "meaning": "Ph\u00fac l\u00e0 ph\u1ea7n \u0111\u01b0\u1ee3c h\u01b0\u1edfng, h\u1ea1nh ph\u00fac, \u0111i\u1ec1u t\u1ed1t l\u00e0nh. Ph\u00fac \u00c2n l\u00e0 ng\u01b0\u1eddi lu\u00f4n nh\u1eadn \u0111\u01b0\u1ee3c \u00e2n tr\u1ea1ch d\u1ed3i d\u00e0o c\u1ee7a t\u1ed5 ti\u00ean, v\u00e0 c\u0169ng l\u00e0m \u0111\u01b0\u1ee3c nh\u1eefng \u0111i\u1ec1u \u00e2n ngh\u0129a, ban ph\u00fac cho \u0111\u1eddi.", "sex": 3}
{"first_name": "Qu\u1ed1c \u00c2n", "meaning": "Ghi nh\u1edb v\u1ec1 c\u00f4ng \u0111\u1ee9c, \u00e2n ngh\u0129a mang t\u1ea7m v\u00f3c l\u1edbn lao, g\u1eafn li\u1ec1n v\u1edbi t\u1ed5 qu\u1ed1c non s\u00f4ng", "sex": 3}
{"first_name": "Thanh \u00c2n", "meaning": "Thanh l\u00e0 thanh khi\u1ebft, s\u1ea1ch s\u1ebd. Thanh \u00c2n l\u00e0 ng\u01b0\u1eddi \u0111\u01b0\u1ee3c ban \u01a1n v\u00e0 lu\u00f4n ban \u01a1n cho k\u1ebb kh\u00e1c 1 c\u00e1ch trung th\u1ef1c, tr\u1ecdn v\u1eb9n, nghi\u00eam t\u00fac.", "sex": 7}
{"first_name": "Th\u00e0nh \u00c2n", "meaning": "\"Th\u00e0nh\" l\u00e0 th\u00e0nh th\u1eadt, \"\u00c2n\" l\u00e0 \u00e2n c\u1ea7n. \"Th\u00e0nh \u00c2n\" c\u00f3 ngh\u0129a l\u00e0 con c\u00f3 t\u1ea5m l\u00f2ng ch\u00e2n th\u00e0nh, bi\u1ebft y\u00eau th\u01b0\u01a1ng, gi\u00fap \u0111\u1ee1 m\u1ecdi ng\u01b0\u1eddi, s\u1ed1ng t\u1ed1t kh\u00f4ng t\u00ednh toan, d\u1ed1i l\u1eeba", "sex": 3}
{"first_name": "Th\u1ea1nh \u00c2n", "meaning": "Th\u1ea1nh l\u00e0 t\u1eeb \u0111\u1ecdc tr\u1ea1i c\u1ee7a Th\u1ecbnh, ngh\u0129a l\u00e0 ph\u1ed3n th\u1ecbnh, ph\u00e1t tri\u1ec3n. Th\u1ea1nh \u00c2n l\u00e0 ng\u01b0\u1eddi \u0111\u01b0\u1ee3c nh\u1eadn \u00e2n \u0111\u1ee9c d\u1ed3i d\u00e0o, t\u1ed1t \u0111\u1eb9p.", "sex": 3}
{"first_name": "Th\u1ebf \u00c2n", "meaning": "Con chi\u0301nh la\u0300 \u00e2n hu\u00ea\u0323 ma\u0300 b\u00f4\u0301 me\u0323 nh\u00e2\u0323n \u0111\u01b0\u01a1\u0323c, la\u0300 tinh tu\u0301y cu\u0309a cu\u00f4\u0323c \u0111\u01a1\u0300i na\u0300y. Ca\u0301i t\u00ean \"Th\u00ea\u0301 \u00c2n\" ma\u0300 b\u00f4\u0301 me\u0323 \u0111\u0103\u0323t cho con se\u0303 theo con \u0111i su\u00f4\u0301t cu\u00f4\u0323c \u0111\u01a1\u0300i, \u0111o\u0301 cu\u0303ng la\u0300 ni\u00ea\u0300m t\u01b0\u0323 ha\u0300o, ngu\u00f4\u0300n \u0111\u00f4\u0323ng vi\u00ean m\u00f4\u0303i b\u01b0\u01a1\u0301c con \u0111i.", "sex": 3}
