{"first_name": "Thi\u00ean \u00c2n", "meaning": "T\u00ean \"Thi\u00ean \u00c2n\" ng\u1ee5 \u00fd v\u00ed con nh\u01b0 m\u00f3n qu\u00e0 qu\u00fd gi\u00e1 m\u00e0 \u00f4ng tr\u1eddi ban t\u1eb7ng cho gia \u0111\u00ecnh. Ngo\u00e0i ra, \"Thi\u00ean \u00c2n\" c\u00f2n l\u00e0 t\u00ean \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng n\u1ed3ng h\u1eadu, chu \u0111\u00e1o, bi\u1ebft y\u00eau th\u01b0\u01a1ng quan t\u00e2m \u0111\u1ebfn ng\u01b0\u1eddi kh\u00e1c", "sex": 7}
