{"first_name": "Th\u00fay \u00c2n", "meaning": "\"Th\u00fay \u00c2n\" c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau, nh\u01b0ng l\u00e0 m\u1ed9t ng\u01b0\u1eddi m\u1ea1nh m\u1ebd v\u00e0 c\u1ee9ng c\u1ecfi, c\u0169ng nh\u01b0 lu\u00f4n s\u1ed1ng tr\u1ecdn v\u1edbi \u00e2n ngh\u0129a, v\u1edbi t\u00ecnh c\u1ea3m c\u1ee7a m\u1ecdi ng\u01b0\u1eddi.", "sex": 5}
