{"first_name": "Tr\u1ecdng \u00c2n", "meaning": "\"Tr\u1ecdng \u00c2n\" c\u00f3 ngh\u0129a l\u00e0 mong con lu\u00f4n ghi nh\u1edb \u01a1n ngh\u0129a s\u00e2u n\u1eb7ng m\u00e0 m\u1ed7i ng\u01b0\u1eddi ch\u00fang ta \u0111\u00e3 th\u1ecd nh\u1eadn v\u00e0 ph\u1ea3i c\u00f3 nhi\u1ec7m v\u1ee5 \u0111\u1ec1n \u0111\u00e1p l\u1ea1i.", "sex": 3}
{"first_name": "Tr\u00fac \u00c2n", "meaning": "Tr\u00fac l\u00e0 c\u00e2y tr\u00fac, th\u1ec3 hi\u1ec7n ch\u00ed kh\u00ed qu\u00e2n t\u1eed. Tr\u00fac \u00c2n l\u00e0 ng\u01b0\u1eddi bi\u1ebft mang \u01a1n \u0111\u1ee9c, ngay th\u1eb3ng, li\u00eam khi\u1ebft, \u0111\u01b0\u1eddng ho\u00e0ng, \u0111\u01b0\u1ee3c ph\u00f2 tr\u1ee3 t\u1ed1t \u0111\u1eb9p v\u00e0 mang l\u1ea1i \u0111i\u1ec1u cao qu\u00fd cho ng\u01b0\u1eddi kh\u00e1c.", "sex": 7}
{"first_name": "T\u1eeb \u00c2n", "meaning": "\"T\u01b0\u0300\" v\u01b0\u0300a mang nghi\u0303a t\u01b0\u0300 t\u00f4\u0301n, v\u01b0\u0300a y\u0301 chi\u0309 s\u01b0\u0323 hi\u00ea\u0300n la\u0300nh, t\u01b0\u0300 bi. \"\u00c2n\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t tr\u1ea1ng th\u00e1i t\u00ecnh c\u1ea3m \u0111\u1eb9p \u0111\u1ebd c\u1ee7a con ng\u01b0\u1eddi, \"\u00c2n\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 chu \u0111\u00e1o, t\u1ec9 m\u1ec9 hay c\u00f2n th\u1ec3 hi\u1ec7n s\u1ef1 mang \u01a1n s\u00e2u s\u1eafc tha thi\u1ebft. V\u00ec v\u1eady, t\u00ean \"T\u01b0\u0300 \u00c2n\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi s\u1ed1ng bi\u1ebft y\u00eau th\u01b0\u01a1ng, \u0111\u01b0\u0301c \u0111\u00f4\u0323.", "sex": 3}
{"first_name": "T\u01b0\u01a1ng \u00c2n", "meaning": "T\u01b0\u01a1ng l\u00e0 nh\u1edb. T\u01b0\u01a1ng \u00c2n l\u00e0 \u00e2n ngh\u0129a m\u00e3i m\u00e3i nh\u1edb kh\u00f4ng qu\u00ean, m\u00e3i m\u00e3i g\u1eafn k\u1ebft kh\u00f4ng phai nh\u1ea1t.", "sex": 7}
{"first_name": "T\u01b0\u1eddng \u00c2n", "meaning": "T\u01b0\u1eddng l\u00e0 r\u00f5 r\u00e0ng, tr\u00ecnh b\u00e0y ra. T\u01b0\u1eddng \u00c2n l\u00e0 ng\u01b0\u1eddi c\u00f3 th\u00e1i \u0111\u1ed9 c\u00f4ng khai, minh b\u1ea1ch, mang l\u1ea1i s\u1ef1 t\u1ed1t \u0111\u1eb9p, th\u00e0nh c\u00f4ng, h\u1ea1nh ph\u00fac cho ng\u01b0\u1eddi ta v\u00e0 c\u0169ng l\u00e0 cho m\u00ecnh.", "sex": 5}
