{"first_name": "Tuy\u1ebft \u00c2n", "meaning": "Tuy\u1ebft l\u00e0 b\u00f4ng tuy\u1ebft, th\u1ec3 hi\u1ec7n s\u1ef1 thanh khi\u1ebft, trong tr\u1eafng, nghi\u00eam trang. Tuy\u1ebft \u00c2n c\u00f3 ngh\u0129a l\u00e0 ng\u01b0\u1eddi lu\u00f4n l\u00e0m nh\u1eefng vi\u1ec7c \u01a1n \u0111\u1ee9c trong s\u00e1ng, t\u1ed1t \u0111\u1eb9p cho ng\u01b0\u1eddi kh\u00e1c, v\u00e0 c\u0169ng nh\u1eadn \u0111\u01b0\u1ee3c nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p t\u1eeb t\u1ed5 ti\u00ean, cha m\u1eb9 1 c\u00e1ch minh b\u1ea1ch, t\u1ecf t\u01b0\u1eddng.", "sex": 5}
