{"first_name": "Chi Anh", "meaning": "\"Chi Anh\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean \u0111\u1eb9p d\u00e0nh t\u1eb7ng cho c\u00e1c b\u00e9 g\u00e1i v\u01a1\u0301i: \"Anh\" - t\u00e0i gi\u1ecfi, xu\u1ea5t ch\u00fang, xinh \u0111\u1eb9p, \"Chi\" trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i. L\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p \u00fd ch\u1ec9 \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. T\u00ean \"Chi Anh\" c\u00f3 \u00fd ngh\u0129a con chi\u0301nh la\u0300 do\u0300ng do\u0303i cao quy\u0301, xinh \u0111\u1eb9p, tinh kh\u00f4i v\u00e0 t\u00e0i gi\u1ecfi.", "sex": 5}
{"first_name": "Ch\u00ed Anh", "meaning": "\"Ch\u00ed\": l\u00e0 \u00fd ch\u00ed, ch\u00ed h\u01b0\u1edbng, ch\u1ec9 s\u1ef1 quy\u1ebft t\u00e2m theo \u0111u\u1ed5i m\u1ed9t l\u00fd t\u01b0\u1edfng hay m\u1ee5c ti\u00eau n\u00e0o \u0111\u00f3. Ch\u1eef \"Anh\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. \"Ch\u00ed Anh\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean v\u1eeba c\u00f3 \u00fd ch\u00ed, c\u00f3 s\u1ef1 b\u1ec1n b\u1ec9 v\u00e0 s\u00e1ng l\u1ea1n chi\u0309 ng\u01b0\u01a1\u0300i ta\u0300i gio\u0309i, xu\u00e2\u0301t chu\u0301ng, t\u01b0\u01a1ng lai ta\u0323o n\u00ean nghi\u00ea\u0323p l\u01a1\u0301n.", "sex": 3}
{"first_name": "Chi\u00eau Anh", "meaning": "Chi\u00eau l\u00e0 r\u1ef1c r\u1ee1. Chi\u00eau Anh c\u00f3 th\u1ec3 hi\u1ec3u l\u00e0 \u00e1nh s\u00e1ng r\u1ef1c r\u1ee1, ch\u00f3i l\u1ecdi, mang h\u00ecnh \u1ea3nh c\u00e1i \u0111\u1eb9p tuy\u1ec7t m\u1ef9, cao qu\u00fd, h\u01a1n ng\u01b0\u1eddi.", "sex": 5}
{"first_name": "C\u00f4ng Anh", "meaning": "L\u1ea5y t\u00ean t\u1eeb lo\u00e0i hoa b\u1ed3 c\u00f4ng anh, m\u1ed9t lo\u00e0i hoa d\u1ea1i sau khi h\u00e9 n\u1edf m\u1ed9t th\u1eddi gian, th\u00ec t\u1eebng c\u00e1nh hoa s\u1ebd ch\u1ea5p bay theo gi\u00f3, hoa bay \u0111i th\u1eadt xa \u0111\u1ec3 ti\u1ebfp t\u1ee5c gieo r\u1eafc sinh s\u00f4i n\u1ea9y n\u1edf. \u0110\u1eb7t t\u00ean n\u00e0y cho con b\u1ed1 m\u1eb9 mong b\u1ea3n t\u00ednh c\u1ee7a con c\u0169ng v\u1eady, th\u00edch \u0111i xa \u0111\u1ec3 kh\u00e1m ph\u00e1 thi\u00ean nhi\u00ean trong b\u1ea7u tr\u1eddi r\u1ed9ng m\u1edf, t\u00ednh m\u1ea1nh m\u1ebd, ki\u00ean c\u01b0\u1eddng, \u0111\u1ea7y nhi\u1ec7t huy\u1ebft \u0111\u1ec3 s\u1eb5n s\u00e0ng \u0111i m\u00e3i kh\u00f4ng ng\u1eebng, \u0111\u1ec3 ti\u1ebfn t\u1edbi m\u1ee5c ti\u00eau v\u00e0 d\u1ed3n h\u1ebft m\u1ecdi n\u1ed7 l\u1ef1c \u0111\u1ec3 \u0111\u1ea1t cho \u0111\u01b0\u1ee3c nh\u1eefng ti\u00eau \u0111\u1ec1 \u0111\u00e3 \u0111\u1eb7t ra.", "sex": 3}
