{"first_name": "H\u1ea1nh Ca", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, t\u00ean \"H\u1ea1nh\", th\u1ee9 nh\u1ea5t, c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 ph\u00fac l\u1ed9c, l\u00e0 ph\u01b0\u1edbc l\u00e0nh; ngh\u0129a th\u1ee9 hai l\u00e0 n\u00f3i v\u1ec1 m\u1eb7t \u0111\u1ea1o \u0111\u1ee9c, t\u00ednh n\u1ebft c\u1ee7a con ng\u01b0\u1eddi. \"Ca\" l\u00e0 b\u00e0i ca, kh\u00fac h\u00e1t. T\u00ean \"H\u1ea1nh Ca\" th\u01b0\u1eddng d\u00f9ng cho n\u1eef, ch\u1ec9 ng\u01b0\u1eddi n\u1ebft na, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, \u0111\u00f4n h\u1eadu, ph\u1ea9m ch\u1ea5t cao \u0111\u1eb9p nh\u01b0 m\u1ed9t kh\u00fac ca cao qu\u00fd.", "sex": 5}
