{"first_name": "H\u1ed3ng Ca", "meaning": "\"H\u1ed3ng Ca\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean con g\u00e1i r\u1ea5t m\u1ed9c m\u1ea1c, gi\u1ea3n d\u1ecb, th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t b\u1edfi nh\u1eefng ng\u01b0\u1eddi v\u00f9ng \u0111\u1ed3ng b\u1eb1ng B\u1eafc Vi\u1ec7t Nam. Con nh\u01b0 l\u1eddi ca kh\u00fac h\u00e1t vui t\u01b0\u01a1i, thanh khi\u1ebft mang \u0111\u1ebfn ni\u1ec1m vui cho \u0111\u1eddi.", "sex": 5}
{"first_name": "H\u00f9ng Ca", "meaning": "\"H\u00f9ng Ca\" l\u00e0 b\u00e0i ca, kh\u00fac h\u00e1t kh\u00ed th\u1ebf h\u00f9ng tr\u00e1ng v\u1edbi nh\u1eefng ca t\u1eeb m\u1ea1nh m\u1ebd . C\u00e1i t\u00ean \"H\u00f9ng Ca\"  b\u1ed1 m\u1eb9 v\u00ed con t\u1ef1a nh\u01b0 nh\u1eefng kh\u00fac ca, nh\u1eefng l\u1eddi th\u01a1, \u00fd nh\u1ea1c \u0111em l\u1ea1i kh\u00f4ng kh\u00ed h\u00e0o h\u00f9ng, s\u00f4i n\u1ed5i, v\u1ebb vang cho \u0111\u1eddi.", "sex": 3}
