{"first_name": "M\u1ea1nh Ca", "meaning": "\"M\u1ea1nh Ca\" trong t\u1eeb \u0111i\u1ec3n Vi\u00ea\u0323t \u0111\u01b0\u1ee3c xem l\u00e0 kh\u00fac ca h\u00f9ng tr\u00e1ng v\u1edbi ca t\u1eeb m\u1ea1nh m\u1ebd. Ngo\u00e0i ra, t\u00ean M\u1ea1nh Ca c\u00f2n c\u00f3 ngh\u0129a b\u1ed1 m\u1eb9 mong con tr\u1edf th\u00e0nh ng\u01b0\u1eddi kh\u1ecfe m\u1ea1nh, s\u1ee9c kh\u1ecfe t\u1ed1t, \u00edt b\u1ec7nh t\u1eadt, s\u1ed1ng m\u1ea1nh m\u1ebd, ki\u00ean c\u01b0\u1eddng.", "sex": 3}
{"first_name": "Minh Ca", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh, t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, Minh c\u00f2n c\u00f3 ngh\u0129a ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (b\u00ecnh minh), th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. \"Ca\" l\u00e0 b\u00e0i ca, kh\u00fac h\u00e1t. S\u1ef1 k\u1ebft h\u1ee3p \u0111\u1ed9c \u0111\u00e1o, \"Minh Ca\" \u00fd ch\u1ec9 con nh\u01b0 kh\u00fac ca ng\u1eddi s\u00e1ng, l\u00e0 kim ch\u1ec9 nam d\u1eabn \u0111\u01b0\u1eddng cho cu\u1ed9c \u0111\u1eddi minh b\u1ea1ch, vinh hi\u1ec3n.", "sex": 3}
{"first_name": "Nam Ca", "meaning": "Nam \u00fd ch\u1ec9 ph\u01b0\u01a1ng Nam, d\u00f9 \u0111i \u0111\u00e2u v\u1eabn h\u01b0\u1edbng v\u1ec1 ph\u00eda Nam. \"Ca\" l\u00e0 b\u00e0i ca, kh\u00fac h\u00e1t. S\u1ef1 k\u1ebft h\u1ee3p \u0111\u1ed9c \u0111\u00e1o trong t\u00ean con nh\u01b0 th\u1ea7m nh\u1eafn nh\u1ee7 l\u1eddi g\u1eedi g\u1eafm c\u1ee7a b\u1ed1 m\u1eb9, con nh\u01b0 nh\u1eefng \u00e2m vang, l\u1eddi ca t\u1eeb m\u1ea3nh \u0111\u1ea5t ph\u01b0\u01a1ng Nam g\u1ee3i l\u00ean bao ho\u00e0i ni\u1ec7m.", "sex": 7}
