{"first_name": "Ph\u00fa Ca", "meaning": "Ch\u1eef \"Ph\u00fa\" theo ngh\u0129a H\u00e1n - Vi\u00ea\u0323t c\u00f3 ngh\u0129a l\u00e0 gi\u00e0u c\u00f3, d\u1ed3i d\u00e0o. \"Ca\" l\u00e0 b\u00e0i ca, kh\u00fac h\u00e1t. \u0110\u1eb7t t\u00ean n\u00e0y cho con, b\u1ed1 m\u1eb9 mong cu\u1ed9c \u0111\u1eddi con nh\u01b0 nh\u1eefng kh\u00fac ca, \u00fd nh\u1ea1c r\u1ed9n r\u00e0ng, t\u01b0\u01a1i vui. B\u00ean c\u1ea1nh \u0111\u00f3, ch\u1eef l\u00f3t Ph\u00fa th\u01b0\u1eddng th\u1ec3 hi\u1ec7n mong mu\u1ed1n v\u1ec1 m\u1ed9t cu\u1ed9c s\u1ed1ng gi\u00e0u sang, sung t\u00fac cho con.", "sex": 3}
