{"first_name": "T\u00f9ng Can", "meaning": "T\u00f9ng l\u00e0 c\u00e2y th\u00f4ng. T\u00f9ng Can l\u00e0 n\u1eafm gi\u1eef g\u1ed1c th\u00f4ng, ngh\u0129a ch\u1ec9 ng\u01b0\u1eddi c\u00f3 th\u00e1i \u0111\u1ed9 ki\u00ean \u0111\u1ecbnh, b\u1ec1n b\u1ec9, ph\u1ea9m ch\u1ea5t cao v\u1ee3i nh\u01b0 c\u00e2y th\u00f4ng gi\u1eefa \u0111\u1ea1i ng\u00e0n.", "sex": 3}
