{"first_name": "Anh C\u1ea9m", "meaning": "Anh l\u00e0 t\u00e0i n\u0103ng. Anh C\u1ea9m l\u00e0 g\u1ea5m l\u1ee5a t\u1ed1t \u0111\u1eb9p, ch\u1ec9 con ng\u01b0\u1eddi c\u00f3 c\u1ed1t c\u00e1ch \u0111\u1ea1o \u0111\u1ee9c", "sex": 5}
{"first_name": "\u00c1nh C\u1ea9m", "meaning": "T\u00ean \u00c1nh theo ngh\u0129a H\u00e1n Vi\u00ea\u0323t, g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng tia s\u00e1ng do m\u1ed9t v\u1eadt ph\u00e1t ra ho\u1eb7c ph\u1ea3n chi\u1ebfu l\u1ea1i, \u00e1nh s\u00e1ng ph\u1ea3n chi\u1ebfu l\u00f3ng l\u00e1nh, soi r\u1ecdi. Theo ngh\u0129a H\u00e1n Vi\u1ec7t, \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. \"\u00c1nh C\u1ea9m\" l\u00e0 t\u00ean d\u00e0nh cho c\u00e1c b\u00e9 g\u00e1i v\u1edbi ng\u1ee5 \u00fd ch\u1ec9 s\u1ef1 th\u00f4ng minh, khai s\u00e1ng, kh\u1ea3 n\u0103ng tinh vi, t\u01b0\u1eddng t\u1eadn v\u1ea5n \u0111\u1ec1 c\u1ee7a con.", "sex": 5}
{"first_name": "B\u00edch C\u1ea9m", "meaning": "Ch\u1eef \"B\u00edch\" theo ngh\u0129a H\u00e1n Vi\u00ea\u0323t, l\u00e0 l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t lo\u00e0i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng. \"C\u1ea9m\" v\u1edbi \u00fd ngh\u0129a mang v\u1ebb \u0111\u1eb9p \u0111a s\u1eafc m\u00e0u v\u00e0 tinh t\u1ebf. V\u00ec v\u1eady t\u00ean \"B\u00edch C\u1ea9m\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 con ng\u01b0\u1eddi v\u1edbi mong mu\u1ed1n m\u1ed9t dung m\u1ea1o xinh \u0111\u1eb9p, s\u00e1ng ng\u1eddi, m\u1ed9t ph\u1ea9m ch\u1ea5t cao qu\u00fd, thanh tao, l\u00e0 ng\u01b0\u1eddi t\u00e0i c\u00e0ng m\u00e0i d\u0169a, c\u00e0ng r\u00e8n luy\u1ec7n s\u1ebd c\u00e0ng t\u1ecfa s\u00e1ng.", "sex": 5}
{"first_name": "\u0110\u0103ng C\u1ea9m", "meaning": "\"\u0110\u0103ng\" trong ti\u1ebfng H\u00e1n - Vi\u00ea\u0323t c\u00f3 ngh\u0129a l\u00e0 ng\u1ecdn \u0111\u00e8n. \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. T\u00ean \"\u0110\u0103ng C\u1ea9m\" l\u00e0 s\u1ef1 k\u1ebft h\u1ee3p \u0111\u1ed9c \u0111\u00e1o t\u1ea1o ra t\u00ean con mang \u00fd ngh\u0129a l\u00e0 s\u1ef1 soi s\u00e1ng & tinh anh, b\u00ean c\u1ea1nh v\u1ebb \u0111\u1eb9p \u0111a m\u00e0u s\u1eafc v\u00e0 tinh t\u1ebf", "sex": 5}
{"first_name": "Di\u1ec7u C\u1ea9m", "meaning": "\"Di\u1ec7u\" theo ngh\u0129a H\u00e1n - Vi\u00ea\u0323t c\u00f3 ngh\u0129a l\u00e0 \u0111\u1eb9p, l\u00e0 tuy\u1ec7t di\u1ec7u, \u00fd ch\u1ec9 nh\u1eefng \u0111i\u1ec1u tuy\u1ec7t v\u1eddi \u0111\u01b0\u1ee3c t\u1ea1o n\u00ean b\u1edfi s\u1ef1 kh\u00e9o l\u00e9o, k\u00ec di\u1ec7u. \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. T\u00ean \"Di\u1ec7u C\u1ea9m\" mang l\u1ea1i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0ng v\u1eabn cu\u1ed1n h\u00fat, tinh t\u1ebf n\u00ean th\u01b0\u1eddng ph\u00f9 h\u1ee3p \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i.", "sex": 5}
{"first_name": "D\u01b0\u01a1ng C\u1ea9m", "meaning": "D\u01b0\u01a1ng c\u00f3 ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng m\u1eb7t tr\u1eddi, l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng cho s\u1ef1 \u1ea5m \u00e1p, v\u1ebb \u0111\u1eb9p r\u1ef1c r\u1ee1, l\u1ea5p l\u00e1nh v\u00e0 to\u1ea3 s\u00e1ng nh\u01b0 nh\u1eefng tia n\u1eafng m\u1eb7t tr\u1eddi. B\u00ean c\u1ea1nh \u0111\u00f3, C\u1ea9m c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. \u0110\u1eb7t t\u00ean \"D\u01b0\u01a1ng C\u1ea9m\" cho con, b\u1ed1 m\u1eb9 mong mu\u1ed1n con mang v\u1ebb \u0111\u1eb9p \u0111a m\u00e0u s\u1eafc v\u00e0 tinh t\u1ebf.", "sex": 5}
{"first_name": "Giang C\u1ea9m", "meaning": "\"Giang\" l\u00e0 d\u00f2ng s\u00f4ng, th\u01b0\u1eddng ch\u1ec9 nh\u1eefng \u0111i\u1ec1u cao c\u1ea3, l\u1edbn lao. \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. D\u00f9ng t\u00ean \"Giang C\u1ea9m\" \u0111\u1eb7t cho con v\u00ec th\u01b0\u1eddng th\u00edch nh\u1eefng h\u00ecnh \u1ea3nh con s\u00f4ng v\u1eeba \u00eam \u0111\u1ec1m, v\u1eeba m\u1ea1nh m\u1ebd, nh\u01b0 cu\u1ed9c \u0111\u1eddi con ng\u01b0\u1eddi c\u00f3 l\u00fac th\u0103ng c\u00f3 l\u00fac tr\u1ea7m, \u0111a d\u1ea1ng v\u00e0 tinh t\u1ebf.", "sex": 5}
{"first_name": "Giao C\u1ea9m", "meaning": "\"Giao\" t\u00ean c\u1ee7a lo\u00e0i c\u1ecf giao, c\u00f3 ti\u1ebfng t\u0103m v\u1eefng b\u1ec1n, g\u1eafn b\u00f3. \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. \"Giao C\u1ea9m\" l\u00e0 s\u1ef1 k\u1ebft h\u1ee3p \u0111\u1ed9c \u0111\u00e1o, t\u1ea1o ra t\u00ean g\u1ecdi l\u1ea1 tai m\u00e0 nhi\u1ec1u \u00fd ngh\u0129a, th\u01b0\u1eddng d\u00f9ng \u0111\u1eb7t cho b\u00e9 g\u00e1i v\u1edbi mong mu\u1ed1n c\u1ee7a b\u1ed1 m\u1eb9 con s\u1ebd nh\u01b0 nh\u00e0nh c\u1ecf giao, \u0111a s\u1eafc m\u00e0u v\u00e0 tinh t\u1ebf.", "sex": 5}
{"first_name": "Ho\u00e0ng C\u1ea9m", "meaning": "\"Ho\u00e0ng\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi v\u0129 \u0111\u1ea1i, c\u00f3 c\u1ed1t c\u00e1ch v\u01b0\u01a1ng gi\u1ea3, v\u1edbi mong mu\u1ed1n t\u01b0\u01a1ng lai ph\u00fa qu\u00fd, sang gi\u00e0u. C\u1ea9m l\u00e0 t\u00ean d\u00e0nh cho c\u00e1c b\u00e9 g\u00e1i v\u1edbi \u00fd ngh\u0129a l\u00e0 mong con c\u00f3 m\u1ed9t v\u1ebb \u0111\u1eb9p r\u1ef1c r\u1ee1, l\u1ea5p l\u00e1nh. \"Ho\u00e0ng C\u1ea9m\" \u0111\u1eb7t cho con v\u1edbi mong mu\u1ed1n con \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng.", "sex": 5}
{"first_name": "H\u1ed3ng C\u1ea9m", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"H\u1ed3ng\" l\u00e0 \u00fd ch\u1ec9 m\u00e0u \u0111\u1ecf, m\u00e0 m\u00e0u \u0111\u1ecf v\u1ed1n th\u1ec3 hi\u1ec7n cho ni\u1ec1m vui, s\u1ef1 may m\u1eafn, c\u00e1t t\u01b0\u1eddng. \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. Theo th\u00f3i quen \u0111\u1eb7t t\u00ean c\u1ee7a ng\u01b0\u1eddi Vi\u1ec7t, t\u00ean H\u1ed3ng C\u1ea9m th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con g\u00e1i, th\u1ec3 hi\u1ec7n r\u00f5 n\u00e9t lo\u00e0i hoa xinh \u0111\u1eb9p, lu\u00f4n ng\u1eddi s\u1eafc h\u01b0\u01a1ng. V\u00ec v\u1eady, t\u00ean H\u1ed3ng C\u1ea9m lu\u00f4n g\u1ee3i s\u1ef1 t\u01b0\u01a1i vui, xinh \u0111\u1eb9p, l\u00e0 h\u00ecnh \u1ea3nh gi\u00e0u s\u1ee9c s\u1ed1ng.", "sex": 5}
{"first_name": "H\u01b0\u01a1ng C\u1ea9m", "meaning": "\"H\u01b0\u01a1ng\" co\u0301 nghi\u0303a la\u0300 mu\u0300i th\u01a1m. \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. \"H\u01b0\u01a1ng C\u1ea9m\" la\u0300 ca\u0301i t\u00ean ngo\u0323t nga\u0300o, nhe\u0323 nha\u0300ng th\u01b0\u01a1\u0300ng du\u0300ng cho be\u0301 ga\u0301i v\u01a1\u0301i y\u0301 nghi\u0303a con nh\u01b0 la\u0300n h\u01b0\u01a1ng \u00eam \u0111\u00ea\u0300m, tinh t\u1ebf mang \u0111\u00ea\u0301n cho cu\u00f4\u0323c \u0111\u01a1\u0300i s\u01b0\u0323 bi\u0300nh an, th\u01b0 tha\u0301i, ta\u0323o ca\u0309m gia\u0301c d\u00ea\u0303 chi\u0323u, \u0111\u01b0\u01a1\u0323c mo\u0323i ng\u01b0\u01a1\u0300i y\u00eau m\u00ea\u0301n.", "sex": 5}
{"first_name": "Huy\u1ec1n C\u1ea9m", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Huy\u1ec1n\" c\u00f3 nhi\u1ec1u ngh\u0129a nh\u01b0 d\u00e2y \u0111\u00e0n, d\u00e2y cung, m\u00e0u \u0111en, d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 n\u00e9t \u0111\u1eb9p m\u00ea ho\u1eb7c, l\u1ea1 l\u1eabm, k\u1ef3 \u1ea3o nh\u01b0ng thu h\u00fat. B\u00ean c\u1ea1nh \u0111\u00f3, C\u1ea9m c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. \"Huy\u1ec1n C\u1ea9m\" l\u00e0 t\u00ean d\u00e0nh cho c\u00e1c b\u00e9 g\u00e1i v\u1edbi \u00fd ngh\u0129a l\u00e0 mong con c\u00f3 m\u1ed9t v\u1ebb \u0111\u1eb9p r\u1ef1c r\u1ee1, l\u1ea5p l\u00e1nh nh\u01b0ng b\u00ed \u1ea9n. V\u00ec v\u1eady, \u0111\u1eb7t t\u00ean n\u00e0y cho con v\u1edbi \u00fd mu\u1ed1n con mang v\u1ebb \u0111\u1eb9p \u0111a m\u00e0u s\u1eafc v\u00e0 tinh t\u1ebf.", "sex": 5}
{"first_name": "Kh\u00e1nh C\u1ea9m", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Kh\u00e1nh\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng s\u1ef1 vi\u1ec7c vui m\u1eebng, mang c\u1ea3m gi\u00e1c h\u00e2n hoan. B\u00ean c\u1ea1nh \u0111\u00f3, \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. T\u00ean \"Kh\u00e1nh C\u1ea9m\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi mang v\u1ebb \u0111\u1eb9p \u0111a m\u00e0u s\u1eafc v\u00e0 tinh t\u1ebf, \u0111\u1ee9c h\u1ea1nh, t\u1ed1t \u0111\u1eb9p, mang l\u1ea1i c\u1ea3m gi\u00e1c vui t\u01b0\u01a1i, hoan h\u1ec9 cho nh\u1eefng ng\u01b0\u1eddi xung quanh.", "sex": 5}
{"first_name": "Kim C\u1ea9m", "meaning": "\"Kim\" theo ti\u1ebfng H\u00e1n - Vi\u00ea\u0323t, c\u00f3 ngh\u0129a l\u00e0 ti\u1ec1n, l\u00e0 v\u00e0ng. C\u1ea9m c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. T\u00ean \"Kim C\u1ea9m\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c cha m\u1eb9 \u0111\u1eb7t v\u1edbi h\u00e0m \u00fd mong mu\u1ed1n cu\u1ed9c s\u1ed1ng sung t\u00fac, ph\u00fa qu\u00fd v\u1eefng b\u1ec1n, ki\u00ean c\u1ed1 d\u00e0nh cho con c\u00e1i. Ngo\u00e0i ra \"Kim C\u1ea9m\" c\u00f2n th\u1ec3 hi\u1ec7n s\u1ef1 qu\u00fd tr\u1ecdng, tr\u00e2n qu\u00fd c\u1ee7a m\u1ecdi ng\u01b0\u1eddi d\u00e0nh cho con.", "sex": 5}
{"first_name": "Lam C\u1ea9m", "meaning": "\"Lam\" l\u00e0 t\u00ean g\u1ecdi c\u1ee7a m\u1ed9t lo\u1ea1i ng\u1ecdc, c\u00f3 m\u00e0u t\u1eeb xanh n\u01b0\u1edbc bi\u1ec3n ng\u1ea3 sang xanh l\u00e1 c\u00e2y, c\u00f2n \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. T\u00ean \"Lam C\u1ea9m\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, qu\u00fd ph\u00e1i c\u00f9ng nh\u1eefng ph\u1ea9m ch\u1ea5t cao sang c\u1ee7a b\u1eadc vua ch\u00faa, s\u1ebd mang l\u1ea1i may m\u1eafn, \u0111i\u1ec1m l\u00e0nh cho nh\u1eefng ng\u01b0\u1eddi th\u00e2n y\u00eau.", "sex": 5}
{"first_name": "L\u1ec7 C\u1ea9m", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"L\u1ec7\" c\u00f3 ngh\u0129a \u01b0\u1edbc l\u1ec7 l\u00e0 xinh \u0111\u1eb9p, m\u1ef9 mi\u1ec1u. \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. T\u00ean \"L\u1ec7 C\u1ea9m\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 dung m\u1ea1o xinh \u0111\u1eb9p c\u1ee7a ng\u01b0\u1eddi con g\u00e1i, ng\u01b0\u1eddi mang v\u1ebb \u0111\u1eb9p \u0111a m\u00e0u s\u1eafc v\u00e0 tinh t\u1ebf.", "sex": 5}
{"first_name": "Minh C\u1ea9m", "meaning": "\"Minh\" b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh, t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, c\u00f2n c\u00f3 ngh\u0129a ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (b\u00ecnh minh), th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. C\u1ea9m l\u00e0 t\u00ean d\u00e0nh cho c\u00e1c b\u00e9 g\u00e1i v\u1edbi \u00fd ngh\u0129a l\u00e0 mong con c\u00f3 m\u1ed9t v\u1ebb \u0111\u1eb9p r\u1ef1c r\u1ee1, l\u1ea5p l\u00e1nh. V\u00ec v\u1eady, \u0111\u1eb7t t\u00ean \"Minh C\u1ea9m\" cho con v\u1edbi \u00fd mu\u1ed1n con mang v\u1ebb \u0111\u1eb9p \u0111a m\u00e0u s\u1eafc v\u00e0 tinh t\u1ebf.", "sex": 5}
{"first_name": "M\u1ef9 C\u1ea9m", "meaning": "M\u1ef9 trong ti\u1ebfng H\u00e1n Vi\u00ea\u0323t c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p, t\u1ed1t l\u00e0nh, \u0111\u1ec3 ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi con g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p nh\u01b0 hoa. B\u00ean c\u1ea1nh \u0111\u00f3, C\u1ea9m c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. T\u00ean \"M\u1ef9 C\u1ea9m\" mang \u00fd ngh\u0129a mong con l\u1edbn l\u00ean xinh \u0111\u1eb9p, t\u00e2m t\u00ednh t\u1ed1t l\u00e0nh.", "sex": 5}
{"first_name": "Ng\u1ecdc C\u1ea9m", "meaning": "\"Ng\u1ecdc\" theo ti\u1ebfng H\u00e1n Vi\u00ea\u0323t l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh, th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed. \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. \"Ng\u1ecdc C\u1ea9m\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u1ecfa s\u00e1ng nh\u01b0 h\u00f2n ng\u1ecdc qu\u00fd, mang v\u1ebb \u0111\u1eb9p \u0111a m\u00e0u s\u1eafc v\u00e0 tinh t\u1ebf.", "sex": 5}
{"first_name": "Nguy\u00ean C\u1ea9m", "meaning": "Nguy\u00ean C\u1ea9m l\u00e0 m\u1ed9t c\u00e1i t\u00ean \u0111\u1eb9p \u0111\u1ec3 \u0111\u1eb7t cho con g\u00e1i v\u1edbi \u00fd ngh\u0129a con l\u00e0 ng\u01b0\u1eddi mang v\u1ebb \u0111\u1eb9p \u0111a m\u00e0u s\u1eafc v\u00e0 tinh t\u1ebf, hi\u00ea\u0300n ho\u0300a, gi\u00e0u \u0111\u1ee9c h\u1ea1nh & t\u00e2m h\u1ed3n trong s\u00e1ng, nguy\u00ean v\u1eb9n, tr\u00f2n \u0111\u1ea7y.", "sex": 5}
{"first_name": "Phi C\u1ea9m", "meaning": "Ch\u1eef \"Phi\" theo ngh\u0129a H\u00e1n - Vi\u00ea\u0323t c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u01b0 bay - di chuy\u1ec3n v\u1edbi t\u1ed1c \u0111\u1ed9 cao. C\u1ea9m c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. T\u00ean \"Phi C\u1ea9m\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi nhanh nh\u1eb9n trong suy ngh\u0129, t\u00ednh c\u00e1ch c\u0169ng nh\u01b0 h\u00e0nh \u0111\u1ed9ng. V\u1ebb ngo\u00e0i thanh t\u00fa, t\u00ednh kh\u00ed \u00f4n h\u00f2a. T\u00ean \"Phi C\u1ea9m\" l\u00e0 \u0111i\u1ec1u m\u00e0 cha m\u1eb9 mong mu\u1ed1n con m\u00ecnh s\u1ebd th\u00f4ng minh, nhanh nh\u1eb9n, l\u00e0m \u0111\u01b0\u1ee3c nhi\u1ec1u \u0111i\u1ec1u phi th\u01b0\u1eddng v\u00e0 v\u01b0\u01a1n t\u1edbi nh\u1eefng t\u1ea7m cao r\u1ea1ng r\u1ee1.", "sex": 5}
{"first_name": "Ph\u01b0\u01a1ng C\u1ea9m", "meaning": "Ch\u1eef \"Ph\u01b0\u01a1ng\" theo ngh\u0129a H\u00e1n - Vi\u00ea\u0323t c\u00f3 mang ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m. \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. \u0110\u00e2y l\u00e0 t\u00ean th\u01b0\u1eddng d\u00f9ng cho b\u00e9 g\u00e1i, \u00fd ch\u1ec9 ng\u01b0\u1eddi s\u00e1ng su\u1ed1t, tr\u00ed tu\u1ec7. T\u00ean \"Ph\u01b0\u01a1ng C\u1ea9m\" l\u00e0 mong mu\u1ed1n c\u1ee7a cha m\u1eb9 mu\u1ed1n con m\u00ecnh lu\u00f4n l\u00e0m nh\u1eefng \u0111i\u1ec1u t\u1ed1t, \u0111i\u1ec1u l\u00e0nh, l\u00e0m cha m\u1eb9 y\u00ean l\u00f2ng.", "sex": 5}
{"first_name": "Ph\u01b0\u1ee3ng C\u1ea9m", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ph\u01b0\u1ee3ng\" l\u00e0 t\u00ean g\u1ecdi t\u1eaft c\u1ee7a lo\u00e0i chim \"Ph\u01b0\u1ee3ng Ho\u00e0ng\", t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 b\u1ea5t di\u1ec7t, s\u1ef1 s\u1ed1ng v\u0129nh c\u1eedu. \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. \"Ph\u01b0\u1ee3ng C\u1ea9m\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd xinh \u0111\u1eb9p r\u1ea1ng ng\u1eddi, kh\u1ecfe m\u1ea1nh, c\u00f3 s\u1ee9c s\u1ed1ng m\u00e3nh li\u1ec7t", "sex": 5}
{"first_name": "Qu\u1ef3nh C\u1ea9m", "meaning": "\"Qu\u1ef3nh\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa ng\u00e1t h\u01b0\u01a1ng th\u01a1m l\u1eebng. Theo truy\u1ec1n thuy\u1ebft, \"Qu\u1ef3nh\" c\u00f2n l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng cho t\u1ea5m l\u00f2ng th\u01a1m th\u1ea3o, nh\u00e2n t\u1eeb. B\u00ean c\u1ea1nh \u0111\u00f3, theo ngh\u0129a H\u00e1n Vi\u1ec7t, \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. V\u00ec v\u1eady, \u0111\u1eb7t t\u00ean \"Qu\u1ef3nh C\u1ea9m\" cho con v\u1edbi \u00fd mu\u1ed1n con mang v\u1ebb \u0111\u1eb9p \u0111a m\u00e0u s\u1eafc v\u00e0 tinh t\u1ebf.", "sex": 5}
{"first_name": "S\u01a1n C\u1ea9m", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, \"S\u01a1n\" l\u00e0 n\u00fai, t\u00ednh ch\u1ea5t c\u1ee7a n\u00fai l\u00e0 lu\u00f4n v\u1eefng ch\u00e3i, h\u00f9ng d\u0169ng v\u00e0 tr\u1ea7m t\u0129nh. \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. V\u00ec v\u1eady t\u00ean \"S\u01a1n C\u1ea9m\" l\u00e0 s\u1ef1 k\u1ebft h\u1ee3p g\u1ee3i c\u1ea3m gi\u00e1c con nh\u01b0 ng\u1ecdn n\u00fai oai nghi, b\u1ea3n l\u0129nh, c\u00f3 th\u1ec3 l\u00e0 ch\u1ed7 d\u1ef1a v\u1eefng ch\u1eafc, an to\u00e0n, b\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n mang v\u1ebb \u0111\u1eb9p \u0111a m\u00e0u s\u1eafc v\u00e0 tinh t\u1ebf.", "sex": 5}
{"first_name": "Th\u00e1i C\u1ea9m", "meaning": "\"Th\u00e1i\" theo ngh\u0129a H\u00e1n - Vi\u00ea\u0323t c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng th\u00e1i, thu\u1eadn l\u1ee3i, ch\u1ec9 s\u1ef1 y\u00ean vui, b\u00ecnh y\u00ean, th\u01b0 th\u00e1i. \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 v\u1ebb \u0111\u1eb9p \u0111a m\u00e0u s\u1eafc v\u00e0 tinh t\u1ebf. \u0110\u1eb7t con t\u00ean \"Th\u00e1i C\u1ea9m\" l\u00e0 mong con c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean, vui v\u1ebb, t\u00e2m h\u1ed3n l\u1ea1c quan, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean.", "sex": 5}
{"first_name": "Thanh C\u1ea9m", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 m\u00e0u xanh, tu\u1ed5i tr\u1ebb, c\u00f2n l\u00e0 s\u1ef1 thanh cao, trong s\u1ea1ch, thanh b\u1ea1ch. \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. Ng\u01b0\u1eddi t\u00ean \"Thanh C\u1ea9m\" th\u01b0\u1eddng c\u00f3 kh\u00ed ch\u1ea5t \u0111i\u1ec1m \u0111\u1ea1m, nh\u1eb9 nh\u00e0ng v\u00e0 cao qu\u00fd, mang v\u1ebb \u0111\u1eb9p \u0111a s\u1eafc m\u00e0u v\u00e0 tinh t\u1ebf.", "sex": 5}
{"first_name": "Thi\u00ean C\u1ea9m", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, \"Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eddi, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. T\u1ef1a nh\u01b0 b\u1ea7u tr\u1eddi bao la, ng\u01b0\u1eddi t\u00ean \"Thi\u00ean C\u1ea9m\" th\u01b0\u1eddng \u0111\u0129nh \u0111\u1ea1c, lu\u00f4n m\u1ea1nh m\u1ebd, c\u00f3 c\u00e1i nh\u00ecn bao qu\u00e1t, t\u1ea7m nh\u00ecn r\u1ed9ng l\u1edbn v\u00e0 mang v\u1ebb \u0111\u1eb9p \u0111a m\u00e0u s\u1eafc, tinh t\u1ebf.", "sex": 5}
{"first_name": "Thu C\u1ea9m", "meaning": "Theo ngh\u0129a Ti\u1ebfng Vi\u1ec7t, \"Thu\" l\u00e0 m\u00f9a thu, l\u00e0 m\u00f9a chuy\u1ec3n ti\u1ebfp t\u1eeb h\u1ea1 sang \u0111\u00f4ng, th\u1eddi ti\u1ebft d\u1ecbu m\u00e1t d\u1ea7n. \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. T\u00ean \"Thu C\u1ea9m\" l\u00e0 mong cho con s\u1ebd trong s\u00e1ng, xinh \u0111\u1eb9p, \u0111a s\u1eafc m\u00e0u nh\u01b0 kh\u00ed tr\u1eddi m\u00f9a thu, \u0111\u1ed3ng th\u1eddi con s\u1ebd lu\u00f4n nh\u1eadn \u0111\u01b0\u1ee3c nhi\u1ec1u s\u1ef1 y\u00eau th\u01b0\u01a1ng v\u00e0 may m\u1eafn.", "sex": 5}
{"first_name": "Th\u1ee5c C\u1ea9m", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"Th\u1ee5c\" c\u00f3 ngh\u0129a l\u00e0 th\u00e0nh th\u1ea1o, thu\u1ea7n th\u1ee5c, n\u00f3i v\u1ec1 nh\u1eefng th\u1ee9 \u0111\u00e3 quen thu\u1ed9c, n\u00f3i v\u1ec1 s\u1ef1 tinh t\u01b0\u1eddng, t\u1ec9 m\u1ec9. \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. \"Th\u1ee5c C\u1ea9m\" l\u00e0 t\u00ean g\u1ecdi kh\u00e1 gi\u1ea3n d\u1ecb \u0111\u01b0\u1ee3c \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i nh\u1eb1m mong \u01b0\u1edbc con c\u00f3 \u0111\u01b0\u1ee3c t\u00ednh ki\u00ean c\u01b0\u1eddng, ch\u0103m ch\u1ec9, tinh t\u1ebf, l\u00e0m g\u00ec c\u0169ng ch\u00fa t\u00e2m ho\u00e0n th\u00e0nh t\u1ed1t.", "sex": 5}
{"first_name": "Th\u00f9y C\u1ea9m", "meaning": "Theo t\u1eeb \u0111i\u1ec3n Ti\u1ebfng Vi\u1ec7t, \"Th\u00f9y\" c\u00f3 ngh\u0129a l\u00e0 th\u00f9y m\u1ecb, n\u1ebft na, \u0111\u1eb1m th\u1eafm. \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. \"Th\u00f9y C\u1ea9m\" l\u00e0 t\u00ean th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho b\u00e9 g\u00e1i v\u1edbi mong mu\u1ed1n con lu\u00f4n xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, \u0111\u00e1ng y\u00eau, cu\u1ed9c \u0111\u1eddi con c\u0169ng nh\u1eb9 nh\u00e0ng nh\u01b0 t\u00ednh c\u00e1ch c\u1ee7a con v\u1eady.", "sex": 5}
{"first_name": "T\u00fa C\u1ea9m", "meaning": "T\u00fa trong ngh\u0129a H\u00e1n - Vi\u00ea\u0323t, l\u00e0 ng\u00f4i sao, v\u00ec tinh t\u00fa l\u1ea5p l\u00e1nh chi\u1ebfu s\u00e1ng tr\u00ean cao. C\u00f2n \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. D\u00f9ng t\u00ean \"T\u00fa C\u1ea9m\" cho con, b\u1ed1 m\u1eb9 ng\u1ea7m \u00fd hi v\u1ecdng con l\u00e0 dung m\u1ea1o xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau.", "sex": 5}
{"first_name": "Xu\u00e2n C\u1ea9m", "meaning": "Xu\u00e2n vi\u1ebft \u0111\u1ea7y \u0111\u1ee7 l\u00e0 m\u00f9a xu\u00e2n: l\u00e0 m\u00f9a c\u1ee7a c\u00e2y c\u1ed1i \u0111\u00e2m ch\u1ed3i, n\u1ea3y l\u1ed9c, sinh s\u00f4i ph\u00e1t tri\u1ec3n. C\u1ea9m c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. \"Xu\u00e2n C\u1ea9m\" l\u00e0 t\u00ean th\u01b0\u1eddng d\u00e0nh cho c\u00e1c b\u00e9 g\u00e1i v\u1edbi hi v\u1ecdng con nh\u01b0 m\u00f9a xu\u00e2n r\u1ea1ng ng\u1eddi, mang v\u1ebb \u0111\u1eb9p \u0111a m\u00e0u s\u1eafc v\u00e0 tinh t\u1ebf.", "sex": 5}
