{"first_name": "Chuy\u00ean C\u1ea7n", "meaning": "Chuy\u00ean l\u00e0 \u0111\u1ec1u \u0111\u1eb7n. Chuy\u00ean C\u1ea7n l\u00e0 si\u00eang n\u0103ng \u0111\u1ec1u \u0111\u1eb7n, t\u00edch c\u1ef1c kh\u00f4ng ng\u1eebng, ng\u1ee5 \u00fd con ng\u01b0\u1eddi n\u1ed7 l\u1ef1c, tr\u00e1ch nhi\u1ec7m.", "sex": 3}
