{"first_name": "M\u1ed9c An", "meaning": "T\u00ean \"An\" nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. \"M\u1ed9c\" t\u01b0\u0301c m\u1ed9c ma\u0323c co\u0301 nghi\u0303a bi\u0300nh di\u0323, ch\u00e2\u0301t pha\u0301c. K\u00ea\u0301t h\u01a1\u0323p \"M\u1ed9c\" va\u0300 \"An\" \u0111\u0103\u0323t t\u00ean cho con th\u00ea\u0309 hi\u00ea\u0323n ti\u0301nh khi\u0301 hi\u00ea\u0300n ho\u0300a, gia\u0309n di\u0323 \u01a1\u0309 con ma\u0300 b\u00f4\u0301 me\u0323 mong mu\u00f4\u0301n", "sex": 5}
{"first_name": "My An", "meaning": "\"My An\" l\u00e0 t\u00ean kh\u00e1 \u0111\u1ed9c \u0111\u00e1o \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i v\u1edbi \"My\" \u00fd ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p. V\u1edbi t\u00ean \"My An\" b\u1ed1 m\u1eb9, mong mu\u1ed1n con s\u1ebd \u0111\u1eb9p v\u00e0 c\u00f3 m\u1ed9t gia \u0111\u00ecnh h\u1ea1nh ph\u00fac, y\u00ean \u1ed5n.", "sex": 5}
{"first_name": "M\u1ef9 An", "meaning": "\"M\u1ef9 An\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi con g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, m\u1ef9 mi\u1ec1u, \u0111\u1ee9c h\u1ea1nh nh\u01b0 ch\u00e2n thi\u1ec7n m\u1ef9 t\u1eeb b\u00ean trong t\u1ea5m l\u00f2ng b\u00ecnh d\u1ecb, dung h\u00f2a, kh\u00f4ng mong c\u1ea7u t\u00e0i l\u1ee3i, s\u1ed1ng an nh\u00e0n y\u00ean b\u00ecnh", "sex": 5}
{"first_name": "Nam An", "meaning": "\"Nam\" t\u01b0\u0301c m\u1ed9t trong b\u1ed1n ph\u01b0\u01a1ng (ph\u01b0\u01a1ng Nam). T\u00ean \"An\" nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. \u0110\u0103\u0323t t\u00ean \"Nam An\" cho con nh\u01b0 hoa\u0300i ni\u1ec7m hay g\u01b0\u0309i g\u0103\u0301m mong mu\u00f4\u0301n v\u00ea\u0300 vu\u0300ng \u0111\u00e2\u0301t ph\u01b0\u01a1ng Nam an la\u0323c, n\u01a1i kha\u0301t vo\u0323ng d\u01a1\u0309 dang va\u0300 mong mu\u00f4\u0301n con trai mi\u0300nh se\u0303 co\u0301 \u0111u\u0309 chi\u0301 h\u01b0\u01a1\u0301ng, hoa\u0300i ba\u0303o nam nhi \u0111\u00ea\u0309 k\u00ea\u0301 tu\u0323c.", "sex": 3}
{"first_name": "Ng\u1ecdc An", "meaning": "\"Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, c\u00f3 \u0111\u1ed9 tinh khi\u1ebft, s\u00e1ng trong l\u1ea5p l\u00e1nh th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c...khi k\u1ebft h\u1ee3p v\u1edbi ch\u1eef \"An\" h\u00e0m \u00fd nh\u1eb9 nh\u00e0ng g\u1ee3i l\u00ean v\u1ebb \u0111\u1eb9p trong s\u00e1ng, thanh khi\u1ebft nh\u01b0 ng\u1ecdc khi\u1ebfn cho b\u1ea5t c\u1ee9 ai c\u0169ng kh\u00f4ng th\u1ec3 n\u00e0o qu\u00ean.", "sex": 5}
{"first_name": "Nguy\u00ean An", "meaning": "\"Nguy\u00ean An\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean \u0111\u1eb9p \u0111\u1ec3 \u0111\u1eb7t cho con g\u00e1i l\u00e2\u0303n con trai v\u1edbi \u00fd ngh\u0129a con l\u00e0 ng\u01b0\u1eddi hi\u00ea\u0300n ho\u0300a, gi\u00e0u \u0111\u1ee9c h\u1ea1nh & t\u00e2m h\u1ed3n trong s\u00e1ng, nguy\u00ean v\u1eb9n tr\u00f2n \u0111\u1ea7y.", "sex": 7}
{"first_name": "Nguy\u1ec7t An", "meaning": "\"Nguy\u1ec7t An\" l\u00e0 t\u00ean d\u00e0nh \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i,  th\u00f4ng th\u01b0\u1eddng l\u00e0 c\u00e1c b\u00e9 g\u00e1i \u0111\u01b0\u1ee3c sinh v\u00e0o c\u00e1c \u0111\u00eam tr\u0103ng tr\u00f2n. \"Nguy\u1ec7t\" c\u00f3 ngh\u0129a l\u00e0 Tr\u0103ng, An mang \u00fd l\u00e0 an l\u00e0nh, tr\u1ecdn v\u1eb9n. Khi \u0111\u1eb7t t\u00ean n\u00e0y b\u1ed1 m\u1eb9 mong con l\u1edbn l\u00ean s\u1ebd xinh \u0111\u1eb9p v\u00e0 ph\u00fac h\u1eadu d\u1ecbu d\u00e0ng nh\u01b0 \u00e1nh tr\u0103ng \u0111\u00eam nh\u1eb9 nh\u00e0ng, y\u00ean b\u00ecnh.", "sex": 5}
{"first_name": "Nh\u00e2n An", "meaning": "Nh\u00e2n l\u00e0 ng\u01b0\u1eddi, Nh\u00e2n An ngh\u0129a l\u00e0 ng\u01b0\u1eddi c\u00f3 ph\u00fac ph\u1eadn y\u00ean b\u00ecnh", "sex": 3}
{"first_name": "Nh\u1ea5t An", "meaning": "\"Nh\u1ea5t An\" th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 trai. V\u1edbi 2 t\u1eeb \"Nh\u1ea5t\" mang ngh\u0129a \"ch\u1ec9 c\u00f3 m\u1ed9t\" v\u00e0 \"An\" l\u00e0 y\u00ean b\u00ecnh. B\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean n\u00e0y cho con h\u00e0m \u00fd cu\u1ed9c s\u1ed1ng c\u1ee7a con \u0111\u01b0\u1ee3c an l\u00e0nh, nh\u1eb9 nh\u00e0ng l\u00e0 \u0111i\u1ec1u quan tr\u1ecdng nh\u1ea5t m\u00e0 b\u1ed1 m\u1eb9 quan t\u00e2m", "sex": 3}
{"first_name": "Nh\u1eadt An", "meaning": "\"Nh\u1eadt An\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean \u0111\u1eb9p th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con trai v\u00e0 c\u1ea3 con g\u00e1i \u1edf Vi\u1ec7t Nam. Theo ti\u1ebfng H\u00e1n, \"Nh\u1eadt\" ngh\u0129a l\u00e0 m\u1eb7t tr\u1eddi; \"An\" ngh\u0129a l\u00e0 y\u00ean \u1ed5n, t\u1ecbnh t\u00e2m, thanh th\u1ea3n trong l\u00f2ng. \"Nh\u1eadt An\" l\u00e0 m\u1eb7t tr\u1eddi d\u1ecbu \u00eam, t\u1ecfa h\u00e0o quang r\u1ef1c r\u1ee1 tr\u00ean m\u1ed9t v\u00f9ng r\u1ed9ng l\u1edbn.", "sex": 5}
