{"first_name": "Th\u1ebf An", "meaning": "\"An\" la\u0300 s\u01b0\u0323 an la\u0300nh c\u1ee7a cu\u1ed9c \u0111\u1eddi, \"An\" mang \u0111\u00ea\u0301n cho b\u00f4\u0301 me\u0323 s\u01b0\u0323 bi\u0300nh y\u00ean, \u00eam \u0111\u00ea\u0300m nh\u01b0 chi\u0301nh t\u00ean go\u0323i.  V\u00ec v\u1eady \u0111\u0103\u0323t t\u00ean \"Th\u00ea\u0301 An\" cho con, \u0111\u00f3 l\u00e0 ngu\u0323 y\u0301 b\u00f4\u0301 m\u1eb9 mong mu\u1ed1n con cu\u0303ng c\u00f3 m\u1ed9t s\u1ed1 m\u1ec7nh may m\u1eafn, tr\u00e1nh m\u1ecdi tai \u01b0\u01a1ng hi\u1ec3m h\u1ecda v\u00e0 lu\u00f4n c\u00f3 s\u1ef1 t\u0129nh l\u1eb7ng c\u1ea7n thi\u1ebft.", "sex": 3}
{"first_name": "Thi\u00ean An", "meaning": "\"\u0110\u00e2y c\u00f3 th\u1ec3 l\u00e0 m\u1ed9t c\u00e1i t\u00ean g\u1ee3i s\u1ef1 cao qu\u00ed, t\u1ed1t l\u00e0nh\r\nT\u1eeb \"\"Thi\u00ean\"\" c\u00f3 ngh\u0129a l\u00e0 ngh\u00ecn, hay ngh\u0129a kh\u00e1c l\u00e0 tr\u1eddi. V\u00ed d\u1ee5: \"\"thi\u00ean m\u1ec7nh\"\" l\u00e0 v\u1eadn m\u1ec7nh tr\u1eddi \u0111\u1ecbnh, \"\"thi\u00ean \u00e2n\"\" l\u00e0 \u01a1n tr\u1eddi\r\nT\u1eeb \"\"An\"\" c\u00f3 ngh\u0129a l\u00e0 y\u00ean l\u00e0nh.\"", "sex": 5}
{"first_name": "Thi\u1ec7n An", "meaning": "\"Thi\u1ec7n\" th\u01b0\u01a1\u0300ng du\u0300ng \u0111\u00ea\u0309 chi\u0309 l\u00e0 ng\u01b0\u1eddi t\u1ed1t, c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, th\u1ec3 hi\u1ec7n t\u00ecnh th\u01b0\u01a1ng bao la b\u00e1c \u00e1i, th\u01b0\u01a1ng ng\u01b0\u1eddi. T\u00ean \"An\" nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. \"Thi\u1ec7n An\" l\u00e0 m\u1ed9t t\u00ean hay v\u00e0 \u00fd ngh\u0129a,\u1ea9n ch\u1ee9a mong mu\u1ed1n, k\u1ef3 v\u1ecdng c\u1ee7a cha m\u1eb9 v\u00e0o \u0111\u1ee9a con y\u00eau qu\u00fd , th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho c\u00e1c b\u00e9 trai.", "sex": 3}
