{"first_name": "Thu An", "meaning": "\"Thu\" t\u01b0\u0301c m\u00f9a thu, mu\u0300a co\u0301 ti\u00ea\u0301t tr\u01a1\u0300i di\u0323u ma\u0301t nh\u00e2\u0301t trong n\u0103m. T\u00ean \"An\" nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. \"Thu An\" c\u00f3 th\u1ec3 \u0111\u01b0\u1ee3c hi\u1ec3u l\u00e0 m\u00f9a thu hi\u1ec1n d\u1ecbu, y\u00ean bi\u0300nh g\u1ee3i l\u00ean v\u1ebb \u0111\u1eb9p hi\u1ec1n ho\u00e0 gi\u1ed1ng m\u00f9a thu c\u00f9ng v\u1edbi \u0111\u1ee9c t\u00ednh hi\u1ec1n l\u00e0nh, t\u1ed1t b\u1ee5ng c\u1ee7a con ng\u01b0\u1eddi. Khi \u0111\u1eb7t t\u00ean \"Thu An\" cho con, b\u1ed1 m\u1eb9 mu\u1ed1n b\u00e9 g\u00e1i c\u1ee7a m\u00ecnh khi l\u1edbn l\u00ean s\u1ebd ki\u00eau sa, \u0111\u00e0i c\u00e1c, trong s\u00e1ng \u0111\u1ea7y n\u1eef t\u00ednh v\u00e0 sang tr\u1ecdng \u0111\u1ec3 ai c\u0169ng ng\u01b0\u1ee1ng m\u1ed9.", "sex": 5}
