{"first_name": "Thu\u0309y An", "meaning": "\"Thu\u0309y\" l\u00e0 n\u01b0\u1edbc, m\u1ed9t trong nh\u1eefng y\u1ebfu t\u1ed1 kh\u00f4ng th\u1ec3 thi\u1ebfu trong \u0111\u1eddi s\u1ed1ng con ng\u01b0\u1eddi. N\u01b0\u1edbc c\u00f3 l\u00fac t\u0129nh l\u1eb7ng, th\u00e2m tr\u1ea7m, nh\u01b0ng c\u0169ng c\u00f3 khi d\u1eef d\u1ed9i m\u00e3nh li\u1ec7t. Th\u00ea\u0301 nh\u01b0ng khi k\u00ea\u0301t h\u01a1\u0323p v\u01a1\u0301i \"An\" - m\u1ed9t c\u00e1i t\u00ean nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3 thi\u0300 t\u00ean \"Thu\u0309y An\" g\u01a1\u0323i l\u00ean s\u1ef1 \u0111\u00e1ng y\u00eau, hi\u00ea\u0300n ho\u0300a, y\u0301 chi\u0309 ng\u01b0\u01a1\u0300i con ga\u0301i trong s\u00e1ng, xinh \u0111\u1eb9p, c\u1ea7n \u0111\u01b0\u1ee3c che ch\u1edf v\u00e0 y\u00eau th\u01b0\u01a1ng.", "sex": 5}
