{"first_name": "Minh Oanh", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, Minh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean,  kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. Minh Oanh l\u00e0 nh\u1eefng ng\u01b0\u1eddi th\u00edch s\u1ef1 s\u00e1ng t\u1ea1o, c\u00f3 t\u00ednh c\u00e1ch \u0111\u1ed9c l\u1eadp, th\u00edch t\u1ef1 m\u00ecnh n\u1ed7 l\u1ef1c ph\u1ea5n \u0111\u1ea5u t\u1ea1o n\u00ean nh\u1eefng th\u00e0nh t\u1ef1u ri\u00eang cho b\u1ea3n th\u00e2n.", "sex": 7}
