{"first_name": "Thi Oanh", "meaning": "Thi l\u00e0 t\u00ean m\u1ed9t lo\u00e0i c\u1ecf c\u00f3 l\u00e1 nh\u1ecf d\u00e0i l\u1ea1i c\u00f3 t\u1eebng k\u1ebd, hoa tr\u1eafng hay \u0111\u1ecf ph\u1edbt, h\u01a1i gi\u1ed1ng nh\u01b0 hoa c\u00fac, m\u1ed7i g\u1ed1c \u0111\u00e2m ra nhi\u1ec1u r\u00f2.   Ng\u01b0\u1eddi t\u00ean Thi Oanh d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, \u0111\u00e1ng y\u00eau, lu\u00f4n l\u00e0 ng\u01b0\u1eddi t\u1ea1o ra nh\u1eefng b\u1ea5t ng\u1edd v\u00e0 nh\u1eefng gi\u00e2y ph\u00fat l\u00e3ng m\u1ea1n. Cha m\u1eb9 mong con sau n\u00e0y s\u1ebd lu\u00f4n g\u1eb7p may m\u1eafn, ph\u00fac l\u1ed9c", "sex": 5}
