{"first_name": "Th\u00f9y Oanh", "meaning": "Theo t\u1eeb \u0111i\u1ec3n Ti\u1ebfng Vi\u1ec7t, \"Th\u00f9y\" c\u00f3 ngh\u0129a l\u00e0 th\u00f9y m\u1ecb, n\u1ebft na, \u0111\u1eb1m th\u1eafm.  \"Th\u00f9y Oanh\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con lu\u00f4n xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, \u0111\u00e1ng y\u00eau.", "sex": 5}
