{"first_name": "T\u1ed1 Oanh", "meaning": "T\u1ed1 Oanh th\u01b0\u1eddng l\u00e0 nh\u1eefng ng\u01b0\u1eddi c\u00f3 t\u1ed1 ch\u1ea5t \u0111\u1eb7c bi\u1ebft, c\u00f3 t\u00e0i n\u0103ng, c\u00f9ng v\u1edbi gi\u1ecdng h\u00e1t hay l\u00e0m lay \u0111\u1ed9ng nhi\u1ec1u tr\u00e1i tim, lu\u00f4n l\u00e0 ng\u01b0\u1eddi bi\u1ebft truy\u1ec1n c\u1ea3m h\u1ee9ng v\u00e0 ng\u1ecdn l\u1eeda nhi\u1ec7t huy\u1ebft \u0111\u1ec3 th\u1eafp s\u00e1ng cho m\u1ecdi ng\u01b0\u1eddi.", "sex": 5}
