{"first_name": "Tr\u00fac Oanh", "meaning": "T\u00ean Tr\u00fac l\u1ea5y h\u00ecnh \u1ea3nh t\u1eeb c\u00e2y tr\u00fac, m\u1ed9t lo\u00e0i c\u00e2y quen thu\u1ed9c v\u1edbi cu\u1ed9c s\u1ed1ng \u0111\u00e3 tr\u1edf th\u00e0nh m\u1ed9t bi\u1ec3u t\u01b0\u1ee3ng cho kh\u00ed ch\u1ea5t thanh cao c\u1ee7a con ng\u01b0\u1eddi. Tr\u00fac Oanh l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a lo\u1ea1i c\u00e2y n\u00e0y tuy c\u1ee9ng m\u00e0 v\u1eabn m\u1ec1m m\u1ea1i, \u0111\u1ed5 m\u00e0 kh\u00f4ng g\u00e3y, r\u1ed7ng ru\u1ed9t nh\u01b0 t\u00e2m h\u1ed3n an nhi\u00ean, t\u1ef1 t\u1ea1i, s\u1ed1ng an l\u1ea1c t\u1ef1 do t\u1ef1 t\u1ea1i kh\u00f4ng th\u00edch \u1ea3nh h\u01b0\u1edfng b\u1edfi c\u00f4ng danh.", "sex": 5}
{"first_name": "T\u00fa Oanh", "meaning": "T\u00fa trong ti\u1ebfng h\u00e1n - vi\u1ec7t l\u00e0 ng\u00f4i sao, v\u00ec tinh t\u00fa l\u1ea5p l\u00e1nh chi\u1ebfu s\u00e1ng tr\u00ean cao. T\u00fa Oanh c\u00f2n c\u00f3 ngh\u0129a l\u00e0 dung m\u1ea1o xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau c\u00f3 t\u00e0i hoa n\u1ed5i b\u1eadt lu\u00f4n mang s\u1ef1 \u1ea5m \u00e1p v\u00e0 an l\u00e0nh \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi xung quanh.", "sex": 7}
