{"first_name": "Tuy\u1ebft Oanh", "meaning": "Tuy\u1ebft Oanh l\u00e0 nh\u1eefng thi\u00ean th\u1ea7n nh\u1ecf, tr\u1eafng tinh kh\u00f4i lu\u00f4n mu\u1ed1n gi\u00fap \u0111\u1ee1 nh\u1eefng ng\u01b0\u1eddi kh\u00e1c b\u1eb1ng h\u1ebft kh\u1ea3 n\u0103ng c\u00f9ng l\u00f2ng nhi\u1ec7t huy\u1ebft c\u1ee7a b\u1ea3n th\u00e2n. N\u00ean \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi n\u1ec3 tr\u1ecdng l\u00e0m vi\u1ec7c g\u00ec c\u0169ng d\u1ec5 d\u00e0ng.", "sex": 5}
{"first_name": "V\u00e2n Oanh", "meaning": "V\u00e2n theo ngh\u0129a H\u00e1n vi\u1ec7t l\u00e0 m\u00e2y, g\u1ee3i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0 \u0111\u00e1m m\u00e2y tr\u1eafng b\u1ed3ng b\u1ec1nh tr\u00ean tr\u1eddi. V\u00e2n Oanh \u0111\u1ec3 h\u00ecnh dung ra m\u1ed9t m\u1ef9 c\u1ea3nh thi\u00ean nhi\u00ean t\u01b0\u01a1i \u0111\u1eb9p, lu\u00f4n c\u00f3 t\u00e0i l\u00e0m nh\u1eefng ng\u01b0\u1eddi xung quanh vui v\u1ebb.", "sex": 5}
