{"first_name": "V\u00e0ng Oanh", "meaning": "V\u00e0ng Oanh l\u00e0 m\u1ed9t lo\u00e0i chim c\u00f3 s\u1ef1 tinh nhanh, s\u1eafc s\u1ea3o nh\u01b0ng b\u1ea3n t\u00ednh hi\u1ec1n l\u00e0nh, th\u00edch l\u00e0 trung t\u00e2m c\u1ee7a m\u1ecdi ng\u01b0\u1eddi n\u00ean th\u01b0\u1eddng n\u1ed7 l\u1ef1c ph\u1ea5n \u0111\u1ea5u h\u1ecdc h\u1ecfi r\u1ea5t nhi\u1ec1u trong h\u1ecdc t\u1eadp c\u0169ng nh\u01b0 trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
{"first_name": "Xu\u00e2n Oanh", "meaning": "L\u00e0 ng\u01b0\u1eddi lanh l\u1ee3i, \u0111\u1ea1i c\u00e1t, c\u00f3 s\u1ee9c s\u1ed1ng nh\u01b0 m\u00f9a xu\u00e2n. Lu\u00f4n mang ni\u1ec1m vui v\u00e0 h\u1ea1nh ph\u00fac th\u1eadt nhi\u1ec1u m\u1ecdi ng\u01b0\u1eddi xung quanh m\u00ecnh.", "sex": 5}
