{"first_name": "Kh\u1ea3i Anh", "meaning": "T\u00ean \"Kh\u1ea3i\" c\u00f3 ngh\u0129a l\u00e0 vui m\u1eebng, h\u00e2n hoan th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi vui v\u1ebb, ho\u1ea1t b\u00e1t, n\u0103ng \u0111\u1ed9ng. Ch\u1eef \"Anh\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 \u201cng\u01b0\u1eddi t\u00e0i gi\u1ecfi\u201d v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. \u0110\u0103\u0323t t\u00ean \"Kha\u0309i Anh\" cho con, b\u00f4\u0301 me\u0323 mong con th\u00f4ng minh s\u00e1ng su\u1ed1t n\u0103ng \u0111\u1ed9ng ho\u1ea1t b\u00e1t vui v\u1ebb, con l\u00e0 ni\u00ea\u0300m vui cho gia \u0111\u00ecnh.", "sex": 3}
