{"first_name": "Khoa Anh", "meaning": "T\u00ean \"Khoa\" th\u01b0\u1eddng mang h\u00e0m \u00fd t\u1ed1t \u0111\u1eb9p, ch\u1ec9 s\u1ef1 vi\u1ec7c to l\u1edbn, d\u00f9ng \u0111\u1ec3 n\u00f3i v\u1ec1 ng\u01b0\u1eddi c\u00f3 \u0111\u1ecba v\u1ecb x\u00e3 h\u1ed9i & tr\u00ecnh \u0111\u1ed9 h\u1ecdc v\u1ea5n. Theo v\u0103n h\u00f3a c\u1ee7a ng\u01b0\u1eddi x\u01b0a, c\u00e1c \u0111\u1ea5ng nam nhi th\u01b0\u1eddng l\u1ea5y c\u00f4ng danh \u0111\u1ed7 \u0111\u1ea1t l\u00e0m tr\u1ecdng n\u00ean t\u00ean \"Khoa\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 mong mu\u1ed1n con c\u00e1i sau n\u00e0y t\u00e0i n\u0103ng, th\u00f4ng minh, ham h\u1ecdc h\u1ecfi, s\u1edbm \u0111\u1ed7 \u0111\u1ea1t th\u00e0nh danh Ch\u1eef \"Anh\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. \u0110\u1eb7t t\u00ean \"Khoa Anh\" t\u01b0\u0301c chi\u0309 ng\u01b0\u01a1\u0300i nam nhi kh\u00f4i ng\u00f4, tu\u00e2\u0301n tu\u0301 ma\u0300 b\u00f4\u0301 me\u0323 mong s\u1ebd l\u00e0 con trong su\u00f4\u0301t cu\u00f4\u0323c \u0111\u01a1\u0300i, \u0111o\u0301 cu\u0303ng la\u0300 ni\u00ea\u0300m t\u01b0\u0323 ha\u0300o, ngu\u00f4\u0300n \u0111\u00f4\u0323ng vi\u00ean m\u00f4\u0303i b\u01b0\u01a1\u0301c con \u0111i.", "sex": 3}
{"first_name": "Kh\u00f4i Anh", "meaning": "T\u00ean \"Kh\u00f4i\" th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi t\u00e0i n\u0103ng b\u1eadc nh\u1ea5t, l\u00e0 ng\u01b0\u1eddi gi\u1ecfi \u0111\u1ee9ng \u0111\u1ea7u trong s\u1ed1 nh\u1eefng ng\u01b0\u1eddi gi\u1ecfi. Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Kh\u00f4i\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 m\u1ed9t th\u1ee9 \u0111\u00e1 \u0111\u1eb9p, qu\u00fd gi\u00e1. Ch\u1eef \"Anh\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 \u201cng\u01b0\u1eddi t\u00e0i gi\u1ecfi\u201d v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. Ngh\u0129a c\u1ee7a \"Kh\u00f4i Anh\" trong t\u00ean g\u1ecdi th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi xinh \u0111\u1eb9p, v\u1ebb ngo\u00e0i tu\u1ea5n t\u00fa, oai v\u1ec7, ph\u1ea9m ch\u1ea5t th\u00f4ng minh, s\u00e1ng d\u1ea1, l\u00e0 ng\u01b0\u1eddi c\u00f3 t\u00e0i & thi c\u1eed \u0111\u1ed7 \u0111\u1ea1t, th\u00e0nh danh.", "sex": 3}
{"first_name": "Ki\u1ebfm Anh", "meaning": "Ki\u1ebfm l\u00e0 v\u0169 kh\u00ed, h\u00e0m \u00fd c\u01b0\u01a1ng tr\u1ef1c, m\u1ea1nh m\u1ebd. Ki\u1ebfm Anh l\u00e0 t\u00ednh c\u00e1ch c\u01b0\u01a1ng tr\u1ef1c, d\u0169ng m\u00e3nh.", "sex": 3}
{"first_name": "Ki\u1ec1u Anh", "meaning": "Con g\u00e1i c\u1ee7a b\u1ed1 m\u1eb9 v\u1eeba th\u00f4ng minh, gi\u1ecfi giang l\u1ea1i v\u1eeba m\u1ec1m m\u1ecfng, d\u1ec5 th\u01b0\u01a1ng. V\u1edbi m\u1ef9 danh n\u00e0y, b\u1ed1 m\u1eb9 mong con s\u1ebd s\u1edf h\u1eefu ti\u1ebfng n\u00f3i nh\u1eb9 nh\u00e0ng, c\u1eed ch\u1ec9 y\u1ec3u \u0111i\u1ec7u, d\u1ec5 th\u01b0\u01a1ng c\u1ee7a ng\u01b0\u1eddi con g\u00e1i thanh nh\u00e3.", "sex": 5}
