{"first_name": "K\u1ef3 Anh", "meaning": "\"Ky\u0300 Anh\" la\u0300 ca\u0301i t\u00ean \u0111\u00f4\u0323c \u0111a\u0301o \u0111\u00ea\u0309 \u0111\u0103\u0323t cho con ga\u0301i, c\u00f3 ngh\u0129a l\u00e0 b\u00f4ng hoa ki\u00eau k\u1ef3 (\"K\u1ef3\" trong ki\u00eau k\u1ef3). Khi \u0111\u1eb7t t\u00ean \"Ky\u0300 Anh\" cho con, b\u1ed1 m\u1eb9 mu\u1ed1n b\u00e9 g\u00e1i c\u1ee7a m\u00ecnh khi l\u1edbn l\u00ean s\u1ebd d\u1ecbu d\u00e0ng nh\u01b0 b\u00f4ng hoa, ki\u00eau sa, \u0111\u00e0i c\u00e1c v\u00e0 sang tr\u1ecdng \u0111\u1ec3 ai c\u0169ng ng\u01b0\u1ee1ng m\u1ed9.", "sex": 5}
{"first_name": "Lam Anh", "meaning": "\"Lam\" l\u00e0 m\u00e0u xanh tr\u1ed9n gi\u1eefa m\u00e0u xanh v\u00e0 m\u00e0u v\u00e0ng. \"Anh\" th\u1ec3 hi\u1ec7n mong mu\u1ed1n t\u1ed1t \u0111\u1eb9p c\u1ee7a cha m\u1eb9 \u0111\u1ec3 con m\u00ecnh gi\u1ecfi giang, xu\u1ea5t ch\u00fang.  T\u00ean \"Lam Anh\" v\u1edbi \u00fd ngh\u0129a l\u00e0 s\u1ef1 h\u00e0i ho\u00e0 c\u1ee7a \u0111\u1ea5t tr\u1eddi c\u00f2n th\u1ec3 hi\u1ec7n con nh\u01b0 tinh t\u1ebf v\u00e0 kh\u00f4n ngoan h\u01a1n ng\u01b0\u1eddi.", "sex": 5}
