{"first_name": "Mai Anh", "meaning": "\"\"\"Mai\"\" l\u00e0 m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p, d\u00f9 \u0111\u00f3 l\u00e0 mai tr\u1eafng x\u1ee9 B\u1eafc (b\u1ea1ch mai) hay mai v\u00e0ng ph\u01b0\u01a1ng Nam (ho\u00e0ng mai). M\u1ed9t nh\u00e0nh mai c\u1eafm v\u00e0o chi\u1ebfc \u0111\u1ed9c b\u00ecnh ng\u00e0y T\u1ebft nh\u01b0 mang l\u1ea1i c\u1ea3 kh\u00f4ng gian tinh khi\u1ebft c\u1ee7a m\u00f9a xu\u00e2n. \r\nHoa mai mang d\u00e1ng v\u1ebb thanh tao, t\u01b0\u1ee3ng tr\u01b0ng cho kh\u00ed ti\u1ebft c\u1ee7a ng\u01b0\u1eddi qu\u00e2n t\u1eed, ch\u00ednh v\u00ec th\u1ebf m\u00e0 mai \u0111\u01b0\u1ee3c c\u00e1c cao nh\u00e2n y\u00eau chu\u1ed9ng v\u00ec t\u00ednh qu\u1eadt c\u01b0\u1eddng. Hoa mai c\u00f2n t\u01b0\u1ee3ng tr\u01b0ng cho kh\u00ed ti\u1ebft trong s\u1ea1ch, nh\u00e2n c\u00e1ch thanh cao. B\u1ed1 m\u1eb9 \u0111\u1eb7t con t\u00ean Mai Anh v\u1edbi ni\u1ec1m k\u1ef3 v\u1ecdng sau n\u00e0y con s\u1ebd l\u00e0 m\u1ed9t c\u00f4 g\u00e1i d\u1ecbu d\u00e0ng, th\u00f9y m\u1ecb nh\u01b0ng c\u01b0\u01a1ng quy\u1ebft, ngh\u1ecb l\u1ef1c v\u00e0 b\u1ea3n l\u0129nh, c\u00f3 c\u00e1i t\u00e2m trong s\u1ea1ch, c\u00f3 c\u00e1i ch\u00ed thanh cao, c\u00f3 phong th\u00e1i \u201cmai c\u1ed1t c\u00e1ch, tuy\u1ebft tinh th\u1ea7n\u201d.\"", "sex": 5}
