{"first_name": "M\u00f4\u0323c Anh", "meaning": "Theo ti\u1ebfng H\u00e1n, \"M\u1ed9c\" nghi\u0303a la\u0300 \u0111\u01a1n s\u01a1, m\u00f4\u0323c ma\u0323c. \"Anh\" ngh\u0129a l\u00e0 th\u00f4ng minh, t\u00e0i gi\u1ecfi h\u01a1n ng\u01b0\u1eddi. \"M\u00f4\u0323c Anh\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean nh\u1eb9 nh\u00e0ng, \u0111\u01b0\u1ee3c g\u1eedi g\u1eafm v\u1edbi \u00fd ngh\u0129a v\u1ec1 m\u1ed9t cu\u1ed9c s\u1ed1ng thanh tao c\u1ee7a m\u1ed9t con ng\u01b0\u1eddi th\u00f4ng minh t\u00e0i gi\u1ecfi.", "sex": 5}
{"first_name": "M\u1ef9 Anh", "meaning": "\"V\u1ebb \u0111\u1eb9p ho\u00e0n m\u1ef9, kh\u00f4ng ch\u1ec9 g\u1ee3i c\u00e1i \u0111\u1eb9p v\u1ec1 h\u00ecnh th\u1ee9c m\u00e0 c\u00f2n \u0111\u1eb9p v\u1ec1 t\u00e2m h\u1ed3n v\u00e0 t\u00e0i n\u0103ng\"", "sex": 5}
{"first_name": "Nam Anh", "meaning": "V\u1edbi t\u00ean g\u1ecdi \"Nam Anh\", con s\u1ebd nh\u01b0 ngu\u1ed3n sinh kh\u00ed v\u00e0 s\u1ee9c m\u1ea1nh c\u1ee7a v\u00f9ng tr\u1eddi ph\u01b0\u01a1ng Nam lu\u00f4n ph\u00e1t huy \u0111\u01b0\u1ee3c h\u1ebft kh\u1ea3 n\u0103ng v\u00e0 s\u1ee9c m\u1ea1nh c\u1ee7a b\u1ea3n th\u00e2n, v\u00ec th\u1ebf s\u1ebd \u0111\u1ea1t \u0111\u01b0\u1ee3c s\u1ef1 huy ho\u00e0ng v\u00e0 h\u01b0ng th\u1ecbnh. Ch\u1eef \"Anh\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. B\u00ean c\u1ea1nh nh\u1eefng may m\u1eafn do tr\u1eddi \u0111\u1ea5t ban t\u1eb7ng, c\u1ed9ng v\u1edbi ch\u00ed kh\u00ed c\u1ee9ng c\u1ecfi, kh\u00f4ng d\u1ec5 b\u1ecb khu\u1ea5t ph\u1ee5c s\u1ebd gi\u00fap con \u0111\u1ea1t \u0111\u01b0\u1ee3c nhi\u1ec1u th\u00e0nh c\u00f4ng trong qu\u00e1 tr\u00ecnh h\u00ecnh th\u00e0nh v\u00e0 ph\u00e1t tri\u1ec3n.", "sex": 3}
{"first_name": "Ng\u00e2n Anh", "meaning": "\"\"\"Ng\u00e2n\"\" c\u00f3 ngh\u0129a l\u00e0 b\u1ea1c, d\u00f2ng s\u00f4ng, \u00e2m thanh vang xa.\r\n\"\"Anh\"\" l\u00e0 xinh \u0111\u1eb9p.T\u00ean \"\"Ng\u00e2n Anh\"\" c\u00f3 ngh\u0129a l\u00e0 con s\u1ebd l\u00e0 m\u1ed9t d\u00f2ng s\u00f4ng hi\u1ec1n h\u00f2a, xinh \u0111\u1eb9p.\"", "sex": 5}
