{"first_name": "Ng\u1eef Anh", "meaning": "Ng\u1eef l\u00e0 l\u1eddi n\u00f3i. Ng\u1eef Anh l\u00e0 l\u1eddi n\u00f3i tinh t\u1ebf, duy\u00ean d\u00e1ng, d\u1ec5 th\u01b0\u01a1ng, h\u1ea5p d\u1eabn v\u1edbi ng\u01b0\u1eddi kh\u00e1c v\u00e0 mang l\u1ea1i s\u1ef1 t\u1ed1t \u0111\u1eb9p, \u0111\u01b0\u1ee3c c\u1ea3m m\u1ebfn cho m\u00ecnh.", "sex": 7}
{"first_name": "Nguy\u00ean Anh", "meaning": "Nguy\u00ean l\u00e0 tr\u1ecdn v\u1eb9n, kh\u1edfi \u0111\u1ea7u \u0111\u1ea7y \u0111\u1ee7. Nguy\u00ean Anh l\u00e0 s\u1ef1 kh\u1edfi \u0111\u1ea7u t\u1ed1t \u0111\u1eb9p, vi\u00ean m\u00e3n, l\u00e0 c\u00e1i \u0111\u1eb9p tr\u00e0n \u0111\u1ea7y, \u0111i\u1ec1u t\u1ed1t tr\u1ecdn v\u1eb9n.", "sex": 7}
{"first_name": "Nguy\u1ec7t Anh", "meaning": "\"Nguy\u1ec7t\": tr\u0103ng, \u00e1nh tr\u0103ng, th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 v\u00ed von so s\u00e1nh v\u1edbi v\u1ebb \u0111\u1eb9p c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. Ch\u1eef Anh theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 \u201cng\u01b0\u1eddi t\u00e0i gi\u1ecfi\u201d. T\u00ean \"Nguy\u1ec7t Anh\" b\u1ed1 m\u1eb9 \u0111\u1eb7t cho con v\u1edb mong mu\u1ed1n con s\u1edf h\u1eefu n\u00e9t \u0111\u1eb9p t\u1ef1 nhi\u00ean c\u1ee7a t\u1ea1o h\u00f3a, di\u1ec5m l\u1ec7 nh\u01b0 \u00e1nh tr\u0103ng huy\u1ec1n ho\u1eb7c.", "sex": 5}
{"first_name": "Nh\u00e3 Anh", "meaning": "Nh\u00e3 l\u00e0 h\u00e0nh vi l\u1ecbch s\u1ef1, th\u00e1i \u0111\u1ed9 t\u00f4n tr\u1ecdng, b\u1eb7t thi\u1ec7p. Nh\u00e3 Anh l\u00e0 ng\u01b0\u1eddi c\u00f3 h\u00e0nh vi b\u1eb7t thi\u1ec7p, tinh t\u1ebf trong giao ti\u1ebfp, bi\u1ebft \u1ee9ng x\u1eed, mang l\u1ea1i \u0111i\u1ec1u t\u1ed1t cho ng\u01b0\u1eddi kh\u00e1c, ni\u1ec1m vui v\u00e0 th\u00e0nh c\u00f4ng cho m\u00ecnh.", "sex": 7}
