{"first_name": "Nh\u01b0 Anh", "meaning": "\"Nh\u01b0\" mang ngh\u0129a t\u01b0\u01a1ng t\u1ef1, gi\u1ed1ng nh\u01b0, c\u00f3 \u00fd so s\u00e1nh. Ch\u1eef \"Anh\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. \"Nh\u01b0 Anh\" th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho con g\u00e1i. \u0110\u00e2y l\u00e0 m\u1ed9t c\u00e1i t\u00ean hay, c\u00f3 \u00fd mu\u1ed1n n\u00f3i \u0111\u1ebfn s\u1ef1 tinh kh\u00f4i, cao sang v\u00e0 s\u00e2u l\u1eafng.", "sex": 5}
{"first_name": "Nh\u1eef Anh", "meaning": "Nh\u1eef l\u00e0 ng\u01b0\u1eddi kh\u00e1c. Nh\u1eef Anh h\u00e0m ngh\u0129a th\u00e1i \u0111\u1ed9 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi \u1ee9ng x\u1eed v\u1edbi k\u1ebb kh\u00e1c m\u1ed9t c\u00e1ch l\u1ecbch s\u1ef1, tr\u00e2n tr\u1ecdng, \u0111\u00e0ng ho\u00e0ng, t\u1eed t\u1ebf v\u1edbi ng\u01b0\u1eddi ta.", "sex": 7}
{"first_name": "Phi Anh", "meaning": "Ch\u1eef \"Phi\" theo ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u01b0 bay - di chuy\u1ec3n v\u1edbi t\u1ed1c \u0111\u1ed9 cao. T\u00ean \"Phi\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi nhanh nh\u1eb9n trong suy ngh\u0129, t\u00ednh c\u00e1ch c\u0169ng nh\u01b0 h\u00e0nh \u0111\u1ed9ng, v\u1ebb ngo\u00e0i thanh t\u00fa, t\u00ednh kh\u00ed \u00f4n h\u00f2a. Ch\u1eef \"Anh\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. T\u00ean \"Phi Anh\" l\u00e0 \u0111i\u1ec1u m\u00e0 cha m\u1eb9 mong mu\u1ed1n con m\u00ecnh s\u1ebd th\u00f4ng minh,nhanh nh\u1eb9n, l\u00e0m \u0111\u01b0\u1ee3c nhi\u1ec1u \u0111i\u1ec1u phi th\u01b0\u1eddng v\u00e0 v\u01b0\u01a1n t\u1edbi nh\u1eefng t\u1ea7m cao.", "sex": 3}
{"first_name": "Ph\u1ee5ng Anh", "meaning": "Ph\u1ee5ng l\u00e0 d\u00e2ng l\u00ean, b\u1ed3i ti\u1ebfp. Ph\u1ee5ng Anh l\u00e0 ng\u01b0\u1eddi c\u00f3 th\u00e1i \u0111\u1ed9 t\u00f4n tr\u1ecdng, l\u1ecbch s\u1ef1, nghi\u00eam trang, th\u00e0nh k\u00ednh, mang l\u1ea1i s\u1ef1 t\u1ed1t \u0111\u1eb9p, ho\u00e0n h\u1ea3o, th\u00e0nh c\u00f4ng cho ng\u01b0\u1eddi v\u00e0 cho \u0111\u1eddi.", "sex": 7}
