{"first_name": "Quang Anh", "meaning": "B\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean n\u00e0y v\u1edbi \u00fd mu\u1ed1n mong con m\u00ecnh th\u00f4ng minh, \u0111\u1ea1t nhi\u1ec1u th\u00e0nh c\u00f4ng l\u00e0m r\u1ea1ng ng\u1eddi gia \u0111\u00ecnh.", "sex": 3}
