{"first_name": "S\u01a1n Anh", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t, \"S\u01a1n\" l\u00e0 n\u00fai, t\u00ednh ch\u1ea5t c\u1ee7a n\u00fai l\u00e0 lu\u00f4n v\u1eefng ch\u00e3i, h\u00f9ng d\u0169ng v\u00e0 tr\u1ea7m t\u0129nh. V\u00ec v\u1eady t\u00ean \"S\u01a1n\" g\u1ee3i c\u1ea3m gi\u00e1c oai nghi, b\u1ea3n l\u0129nh, c\u00f3 th\u1ec3 l\u00e0 ch\u1ed7 d\u1ef1a v\u1eefng ch\u1eafc an to\u00e0n.Ch\u1eef \"Anh\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. \u0110\u1eb7t t\u00ean \"S\u01a1n Anh\" \u00fd n\u00f3i con chi\u0301nh la\u0300 ve\u0309 \u0111e\u0323p tinh tu\u0301y cu\u0309a nu\u0301i, lu\u00f4n mang d\u00e1ng v\u1ebb h\u00f9ng v\u0129 v\u00e0 tr\u00e1ng l\u1ec7 d\u00f9 nh\u00ecn ng\u1eafm d\u01b0\u1edbi b\u1ea5t k\u1ef3 go\u0301c \u0111\u00f4\u0323 na\u0300o.", "sex": 3}
