{"first_name": "\u00c1nh Mai", "meaning": "Mai l\u00e0 t\u00ean lo\u00e0i hoa n\u1edf v\u00e0o m\u00f9a xu\u00e2n, b\u00e1o hi\u1ec7u ni\u1ec1m vui v\u00e0 tr\u00e0n \u0111\u1ea7y hy v\u1ecdng. \u00c1nh l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 ph\u1ea3n chi\u1ebfu. \u00c1nh Mai c\u00f3 ngh\u0129a con xinh \u0111\u1eb9p, chi\u1ebfu r\u1ecdi hy v\u1ecdng ni\u1ec1m vui nh\u01b0 hoa mai b\u00e1o may m\u1eafn, t\u1ed1t l\u00e0nh", "sex": 5}
{"first_name": "B\u1ea1ch Mai", "meaning": "T\u1eeb \"B\u1ea1ch\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u00e0u tr\u1eafng. \"B\u1ea1ch Mai\" l\u00e0 hoa mai tr\u1eafng - Hoa mai tr\u1eafng th\u01b0\u1eddng c\u00f3 5 c\u00e1nh nh\u01b0ng kh\u00e1c v\u1edbi hoa mai v\u00e0ng \u1edf ch\u1ed7 khi hoa m\u1edbi n\u1edf c\u00f3 m\u00e0u \u0111\u1ecf h\u1ed3ng, sau chuy\u1ec3n sang m\u00e0u tr\u1eafng, c\u00f3 m\u00f9i th\u01a1m nh\u1eb9. T\u00ean \"B\u1ea1ch Mai\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, bi\u1ebft c\u00e1ch \u0111\u1ed1i nh\u00e2n x\u1eed th\u1ebf \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi y\u00eau m\u1ebfn, k\u00ednh tr\u1ecdng", "sex": 5}
{"first_name": "Ban Mai", "meaning": "\"Ban mai\" ngh\u0129a l\u00e0 b\u00ecnh minh hay r\u1ea1ng \u0111\u00f4ng - khi m\u1eb7t tr\u1eddi v\u1eabn c\u00f2n n\u1eb1m d\u01b0\u1edbi \u0111\u01b0\u1eddng ch\u00e2n tr\u1eddi. Trong v\u0103n h\u00f3a d\u00e2n gian, ng\u01b0\u1eddi ta tin r\u1eb1ng r\u1ea1ng \u0111\u00f4ng xua \u0111u\u1ed5i c\u00e1c lo\u1ea1i ma qu\u1ef7, y\u00eau tinh, mang l\u1ea1i nh\u1eefng kh\u1edfi \u0111\u1ea7u m\u1edbi m\u1ebb v\u00e0 t\u1ed1t \u0111\u1eb9p. T\u00ean \"Ban Mai\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi lu\u00f4n r\u1ea1ng r\u1ee1 nh\u01b0 b\u00ecnh minh, s\u1ef1 xu\u1ea5t hi\u1ec7n c\u1ee7a h\u1ecd mang t\u1edbi ni\u1ec1m vui v\u00e0 h\u1ea1nh ph\u00fac cho m\u1ecdi ng\u01b0\u1eddi xung quanh.", "sex": 5}
{"first_name": "B\u00edch Mai", "meaning": "Mai l\u00e0 t\u00ean lo\u00e0i hoa n\u1edf v\u00e0o m\u00f9a xu\u00e2n, b\u00e1o hi\u1ec7u ni\u1ec1m vui v\u00e0 tr\u00e0n \u0111\u1ea7y hy v\u1ecdng. B\u00edch l\u00e0 ng\u1ecdc b\u00edch xinh \u0111\u1eb9p, qu\u00fd gi\u00e1. B\u00edch Mai c\u00f3 ngh\u0129a con xinh \u0111\u1eb9p nh\u01b0 hoa, qu\u00fd gi\u00e1 nh\u01b0 ng\u1ecdc", "sex": 5}
{"first_name": "C\u00e1t Mai", "meaning": "M\u01b0\u1ee3n t\u00ean m\u1ed9t lo\u00e0i hoa \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho con. Hoa Mai l\u00e0 m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p n\u1edf v\u00e0o \u0111\u1ea7u m\u00f9a xu\u00e2n - m\u1ed9t m\u00f9a xu\u00e2n tr\u00e0n tr\u1ec1 \u01b0\u1edbc m\u01a1 v\u00e0 hy v\u1ecdng. B\u00ean c\u1ea1nh \u0111\u00f3, \"C\u00e1t\" trong ch\u1eef C\u00e1t T\u01b0\u1eddng \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng s\u1ef1 vi\u1ec7c vui m\u1eebng, mang c\u1ea3m gi\u00e1c h\u00e2n hoan, th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 di\u1ec5n t\u1ea3 nh\u1eefng \u0111i\u1ec1u may m\u1eafn, t\u1ed1t l\u00e0nh. T\u00ean \"Mai C\u00e1t\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 \u0111\u1ee9c h\u1ea1nh, mang l\u1ea1i c\u1ea3m gi\u00e1c vui t\u01b0\u01a1i, hoan h\u1ec9 v\u00e0 nhi\u1ec1u ph\u00fac l\u00e0nh cho nh\u1eefng ng\u01b0\u1eddi xung quanh.", "sex": 5}
