{"first_name": "Chi Mai", "meaning": "\"Chi Mai\" c\u00f3 ngh\u0129a l\u00e0 c\u00e0nh mai - \u00fd ch\u1ec9 s\u1ee9c s\u1ed1ng m\u00e3nh li\u1ec7t c\u1ee7a lo\u00e0i hoa mai xinh \u0111\u1eb9p n\u00e0y, ch\u1ec9 c\u1ea7n c\u1eaft m\u1ed9t c\u00e0nh mai c\u1eafm v\u00e0o b\u00ecnh ho\u1eb7c ch\u1eadu hoa, hoa v\u1eabn n\u1edf r\u1ea5t \u0111\u1eb9p m\u00e0 kh\u00f4ng c\u1ea7n ph\u1ea3i tr\u1ed3ng d\u01b0\u1edbi \u0111\u1ea5t. T\u00ean \"Chi Mai\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 s\u1ee9c s\u1ed1ng v\u00e0 ni\u1ec1m hy v\u1ecdng tuy\u1ec7t v\u1eddi v\u00e0 \u0111\u1eb7c bi\u1ec7t r\u1ea5t xinh \u0111\u1eb9p v\u00e0 kh\u1ecfe m\u1ea1nh d\u00f9 trong b\u1ea5t k\u1ef3 ho\u00e0n c\u1ea3nh n\u00e0o.", "sex": 5}
{"first_name": "Di\u1ec7u Mai", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Mai\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho con. Hoa mai l\u00e0 m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p n\u1edf v\u00e0o \u0111\u1ea7u m\u00f9a xu\u00e2n - m\u1ed9t m\u00f9a xu\u00e2n tr\u00e0n tr\u1ec1 \u01b0\u1edbc m\u01a1 v\u00e0 hy v\u1ecdng. T\u00ean \"Mai\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 v\u00f3c d\u00e1ng thanh t\u00fa, lu\u00f4n tr\u00e0n \u0111\u1ea7y s\u1ee9c s\u1ed1ng \u0111\u1ec3 b\u1eaft \u0111\u1ea7u m\u1ecdi vi\u1ec7c. \"Di\u1ec7u\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1eb9p, l\u00e0 tuy\u1ec7t di\u1ec7u, \u00fd ch\u1ec9 nh\u1eefng \u0111i\u1ec1u tuy\u1ec7t v\u1eddi \u0111\u01b0\u1ee3c t\u1ea1o n\u00ean b\u1edfi s\u1ef1 kh\u00e9o l\u00e9o, k\u00ec di\u1ec7u. \"Mai Di\u1ec7u\" mong mu\u1ed1n con lu\u00f4n xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng nh\u01b0 nh\u1eefng c\u00e1nh hoa mai khoe s\u1eafc xu\u00e2n.", "sex": 5}
