{"first_name": "Thu Mai", "meaning": "\"Thu Mai\" c\u00f3 ngh\u0129a l\u00e0 bu\u1ed5i s\u00e1ng m\u00f9a thu - m\u00f9a thu th\u01b0\u1eddng \u0111\u01b0\u1ee3c ng\u01b0\u1eddi ta nh\u00e2n c\u00e1ch h\u00f3a nh\u01b0 m\u1ed9t ng\u01b0\u1eddi ph\u1ee5 n\u1eef \u0111\u1eb9p, kh\u1ecfe m\u1ea1nh \u0111\u01b0\u1ee3c trang \u0111i\u1ec3m b\u1eb1ng c\u00e1c lo\u1ea1i qu\u1ea3, rau qu\u1ea3 v\u00e0 ng\u0169 c\u1ed1c v\u00e0o m\u00f9a thu ho\u1ea1ch. T\u00ean \"Thu Mai\" nh\u1eb1m ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, tr\u00e0n \u0111\u1ea7y s\u1ee9c s\u1ed1ng nh\u01b0 bu\u1ed5i s\u00e1ng m\u00f9a thu trong l\u00e0nh v\u1edbi  c\u00e1i hiu hiu l\u1ea1nh c\u1ee7a gi\u00f3 th\u1eafm \u0111\u01b0\u1ee3m l\u00f2ng ng\u01b0\u1eddi", "sex": 5}
