{"first_name": "\u00c2u Kh\u1ea3", "meaning": "\" \u00c2u Kh\u1ea3\" c\u00f3 \u00fd ngh\u0129a l\u00e0 c\u00e1nh chim h\u1ea3i \u00e2u bay l\u01b0\u1ee3n tr\u00ean b\u1ea7u tr\u1eddi, t\u1ef1 do t\u1ef1 t\u1ea1i, cu\u1ed9c s\u1ed1ng phong l\u01b0u y\u00eau \u0111\u1eddi m\u00e0 ai c\u0169ng mong mu\u1ed1n c\u00f3 \u0111\u01b0\u1ee3c. Ngo\u00e0i ra b\u1ed1 m\u1eb9 c\u00f2n ng\u1ee5 \u00fd con l\u00e0 ng\u01b0\u1eddi c\u00f3 l\u1ed1i h\u00e0nh x\u1eed kh\u00f4n ngoan, kh\u00e9o l\u00e9o, l\u00e0 m\u1ed9t ng\u01b0\u1eddi r\u1ea5t th\u00fa v\u1ecb. Con l\u00e0 ng\u01b0\u1eddi lu\u00f4n bi\u1ebft thay \u0111\u1ed5i v\u00e0 \u1ee9ng ph\u00f3 v\u1edbi cu\u1ed9c \u0111\u1ea7y bi\u1ebfn \u0111\u1ed9ng.", "sex": 5}
{"first_name": "T\u1ed1 Kh\u1ea3", "meaning": "\"Kh\u1ea3\" l\u00e0 \u0111\u00e1ng y\u00eau, d\u1ec5 th\u01b0\u01a1ng, n\u1ee5 c\u01b0\u1eddi kh\u1ea3 \u00e1i. \"T\u1ed1\" l\u00e0 m\u1ed9c m\u1ea1c, b\u00ecnh d\u1ecb, cao khi\u1ebft. \u0110\u1eb7t t\u00ean \" T\u1ed1 Kh\u1ea3\" l\u00e0 mong con s\u1ebd m\u00e3i xinh \u0111\u1eb9p v\u1edbi n\u00e9t \u0111\u00e1ng y\u00ean, m\u1ed9c m\u1ea1c, gi\u1ea3n \u0111\u01a1n v\u00e0 lu\u00f4n vui v\u1ebb, h\u1ea1nh ph\u00fac", "sex": 5}
