{"first_name": "T\u01b0\u1eddng An", "meaning": "T\u01b0\u1eddng l\u00e0 r\u00f5 r\u00e0ng, tr\u00ecnh b\u00e0y ra. T\u01b0\u1eddng An l\u00e0 s\u1ef1 an l\u00e0nh r\u00f5 r\u00e0ng, minh b\u1ea1ch, h\u00e0m ngh\u0129a ch\u00fac ph\u00fac; b\u00ecnh an, may m\u1eafn su\u1ed1t \u0111\u1eddi.", "sex": 7}
{"first_name": "Tuy\u1ebft An", "meaning": "\u0110\u00e2y l\u00e0 t\u00ean ph\u1ed5 bi\u1ebfn th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i \u1edf Vi\u1ec7t Nam. V\u1edbi \"Tuy\u1ebft\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eafng, tinh kh\u00f4i, \u0111\u1eb9p \u0111\u1ebd, \"An\"  c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh, \u1ed5n \u0111\u1ecbnh. T\u00ean \"Tuy\u1ebft An\" mamg \u00fd ngh\u0129a con l\u00e0 thi\u00ean th\u1ea7n nh\u1ecf b\u00e9, tinh kh\u00f4i, lu\u00f4n mang \u0111\u1ebfn b\u00ecnh an cho b\u1ed1 m\u1eb9.", "sex": 5}
{"first_name": "V\u00e2n An", "meaning": "\"V\u00e2n\" c\u00f3 ngh\u0129a l\u00e0 m\u00e2y, th\u1ec3 hi\u1ec7n s\u1ef1 nh\u1eb9 nh\u00e0ng, t\u1ef1 do t\u1ef1 t\u1ea1i. \"V\u00e2n An\" c\u00f3 ngh\u0129a l\u00e0 mong mu\u1ed1n cu\u1ed9c s\u1ed1ng c\u1ee7a con s\u1ebd an nhi\u00ean, t\u1ef1 t\u1ea1i, thong dong, b\u00ecnh y\u00ean nh\u01b0 \u00e1ng m\u00e2y tr\u00ean tr\u1eddi", "sex": 5}
{"first_name": "Vi\u1ebft An", "meaning": "Vi\u1ebft l\u00e0 tr\u00ecnh b\u00e0y ra. Vi\u1ebft An l\u00e0 mong \u01b0\u1edbc th\u00e1i \u0111\u1ed9 nghi\u00eam t\u00fac, c\u00f3 \u0111\u01b0\u1ee3c s\u1ef1 an l\u00e0nh, t\u1ed1t \u0111\u1eb9p tr\u1ecdng m\u1ecdi h\u00e0nh vi c\u1eed ch\u1ec9, c\u00f3 th\u00e1i \u0111\u1ed9 cu\u1ed9c s\u1ed1ng an nhi\u00ean, t\u01b0\u01a1i s\u00e1ng.", "sex": 3}
{"first_name": "Vi\u1ec7t An", "meaning": "Vi\u1ec7t l\u00e0 v\u01b0\u1ee3t l\u00ean, l\u00e0 Vi\u1ec7t Nam. Vi\u1ec7t An c\u00f3 ngh\u0129a l\u00e0 mong ch\u00fac \u0111i\u1ec1u an l\u00e0nh cho \u0111\u1ea5t n\u01b0\u1edbc Vi\u1ec7t Nam, c\u0169ng c\u00f3 ngh\u0129a l\u00e0 ng\u01b0\u1eddi lu\u00f4n n\u1ed7 l\u1ef1c v\u01b0\u1ee3t l\u00ean m\u1ecdi vi\u1ec7c 1 c\u00e1ch an l\u00e0nh.", "sex": 3}
{"first_name": "V\u0129nh An", "meaning": "\"V\u0129nh\" mang \u00fd ngh\u0129a tr\u01b0\u1eddng t\u1ed3n, v\u0129nh vi\u1ec5n. T\u00ean\"An\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 m\u1ed9t c\u00e1i t\u00ean nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. \u0110\u1eb7t t\u00ean \"V\u0129nh An\" cho con, b\u1ed1 m\u1eb9 hi v\u1ecdng cu\u1ed9c s\u1ed1ng c\u1ee7a con lu\u00f4n b\u1eb1ng ph\u1eb3ng, an l\u00e0nh, kh\u00f4ng g\u1eb7p nhi\u1ec1u s\u1ed1ng gi\u00f3.", "sex": 7}
{"first_name": "Vy\u0303 An", "meaning": "\"Vy\u0303\" th\u00ea\u0309 hi\u00ea\u0323n mong \u01b0\u01a1\u0301c con trai mi\u0300nh co\u0301 th\u00ea\u0309 pha\u0301ch c\u01b0\u01a1\u0300ng tra\u0301ng, kho\u0309e ma\u0323nh. T\u00ean \"An\" nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. V\u00ec v\u1eady khi \u0111\u1eb7t t\u00ean \"Vy\u0303 An\" cho con, \u0111\u00f3 l\u00e0 l\u00fac cha m\u1eb9 mong mu\u1ed1n con c\u00f3 m\u1ed9t s\u1ed1 th\u00e2n th\u00ea\u0309 ma\u0323nh kho\u0309e, an la\u0300nh.", "sex": 3}
{"first_name": "Xu\u00e2n An", "meaning": "Ngh\u0129a l\u00e0 c\u1ea3nh s\u1eafc \u0111\u1eb9p \u0111\u1ebd, an l\u00e0nh c\u1ee7a m\u00f9a xu\u00e2n, th\u1ec3 hi\u1ec7n s\u1ee9c s\u1ed1ng, n\u00e9t \u0111\u1eb9p ho\u00e0n m\u1ef9 c\u1ee7a thi\u00ean nhi\u00ean.", "sex": 5}
{"first_name": "B\u0103ng Oai", "meaning": "B\u0103ng l\u00e0 gi\u00e1 l\u1ea1nh. B\u0103ng Oai ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i ki\u00ean c\u01b0\u1eddng r\u1eafn r\u1ecfi, t\u00e2m \u00fd v\u1eefng v\u00e0ng, m\u1ea1nh m\u1ebd v\u1edbi \u00fd ch\u00ed s\u1eaft \u0111\u00e1.", "sex": 5}
{"first_name": "B\u1ea3o Oai", "meaning": "B\u1ea3o l\u00e0 qu\u00fd gi\u00e1. B\u1ea3o Oai \u0111\u01b0\u1ee3c hi\u1ec3u l\u00e0 v\u1eadt qu\u00fd b\u00e1u c\u1ee7a ch\u00e2u \u00c1, th\u1ec3 hi\u1ec7n cha m\u1eb9 xem con nh\u01b0 b\u00e1u v\u1eadt v\u00f4 gi\u00e1, c\u1ed1t c\u00e1ch m\u1ea1nh m\u1ebd, uy phong nh\u01b0 m\u1ed9t c\u00e2y \u0111\u1ea1i th\u1ee5 c\u1ee7a n\u01b0\u1edbc nh\u00e0.", "sex": 7}
{"first_name": "\u0110\u1ea1i Oai", "meaning": "\u0110\u1ea1i Oai ngh\u0129a l\u00e0  to l\u1edbn, h\u00e0m ngh\u0129a s\u1ef1 h\u00f9ng m\u1ea1nh, to l\u1edbn, h\u00f9ng m\u1ea1nh, ph\u00e1t tri\u1ec3n v\u01b0\u01a1n ra ngo\u00e0i c\u00e1c ch\u00e2u l\u1ee5c kh\u00e1c.", "sex": 3}
{"first_name": "D\u00e2n Oai", "meaning": "T\u00ean con th\u00ea\u0309 hi\u00ea\u0323n kh\u00e1t v\u1ecdng c\u1ea7u mong qu\u1ed1c th\u00e1i d\u00e2n an, thi\u00ean h\u1ea1 th\u00e1i b\u00ecnh; Cho\u0323n cho con ca\u0301i t\u00ean D\u00e2n Oai,th\u00ea\u0309 hi\u00ea\u0323n r\u0103\u0300ng con co\u0301 su\u00f4\u0323c s\u00f4\u0301ng an la\u0300nh, y\u00ean \u00f4\u0309n, h\u01b0\u01a1\u0301ng thi\u00ea\u0323n \u0111\u1ec3 c\u00f3 t\u01b0\u01a1ng lai s\u00e1ng l\u1ea1n, nh\u1edd v\u00e0o \u00fd ch\u00ed chi\u1ebfn \u0111\u1ea5u ki\u00ean c\u01b0\u1eddng, b\u1ea5t khu\u1ea5t kh\u00f4ng ng\u1ea1i kh\u00f3 v\u00e0 s\u1ee3 kh\u1ed5.", "sex": 3}
{"first_name": "\u0110\u0103ng Oai", "meaning": "\u0110\u0103ng l\u00e0 ng\u1ecdn \u0111\u00e8n. \u0110\u0103ng Oai c\u00f3 ngh\u0129a l\u00e0 ng\u1ecdn \u0111\u00e8n tr\u00ed tu\u1ec7, th\u00f4ng su\u1ed1t m\u1ecdi \u0111i\u1ec1u, l\u00e0 ng\u01b0\u1eddi c\u00f3 kh\u00ed ch\u1ea5t lu\u00f4n bi\u1ebft th\u1ec3 hi\u1ec7n m\u00ecnh v\u00e0 l\u00e0 t\u00e2m \u0111i\u1ec3m ch\u00fa \u00fd c\u1ee7a m\u1ecdi ng\u01b0\u1eddi xung quanh.", "sex": 3}
{"first_name": "Di\u1ec7u Oai", "meaning": "\"Di\u1ec7u\" theo ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 \u0111\u1eb9p, l\u00e0 tuy\u1ec7t di\u1ec7u, \u00fd ch\u1ec9 nh\u1eefng \u0111i\u1ec1u tuy\u1ec7t v\u1eddi \u0111\u01b0\u1ee3c t\u1ea1o n\u00ean b\u1edfi s\u1ef1 kh\u00e9o l\u00e9o, k\u00ec di\u1ec7u. T\u00ean An theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 m\u1ed9t c\u00e1i t\u00ean nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. \"Di\u1ec7u An\" mang l\u1ea1i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0ng v\u1eabn cu\u1ed1n h\u00fat, \u1ea5n t\u01b0\u1ee3ng n\u00ean th\u01b0\u1eddng ph\u00f9 h\u1ee3p \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i.", "sex": 5}
{"first_name": "\u0110\u00ecnh Oai", "meaning": "\u0110\u00ecnh l\u00e0 n\u01a1i quan vi\u00ean l\u00e0m vi\u1ec7c. \u0110\u00ecnh Oai l\u00e0 kh\u1edfi \u0111\u1ea7u ch\u1ed1n quan vi\u00ean, ch\u1ec9 con ng\u01b0\u1eddi t\u00e0i c\u00e1n th\u00e0nh \u0111\u1ea1t d\u00e1m v\u01b0\u01a1n l\u00ean nh\u1edd ngh\u1ecb l\u1ef1c c\u1ee7a b\u1ea3n th\u00e2n \u0111\u1ec3 l\u00e0m n\u00ean vi\u1ec7c l\u1edbn.", "sex": 3}
{"first_name": "\u0110\u00f4ng Oai", "meaning": "\u0110\u00f4ng c\u00f3 ngh\u0129a l\u00e0 h\u01b0\u1edbng m\u1eb7t tr\u1eddi m\u1ecdc, h\u01b0\u1edbng thu\u1ea7n d\u01b0\u01a1ng, t\u1ed1t \u0111\u1eb9p. \u0110\u00f4ng Oai h\u00e0m ngh\u0129a s\u1ef1 kh\u1edfi \u0111\u1ea7u m\u1edbi, t\u1ed1t \u0111\u1eb9p, gi\u1ed1ng tia n\u1eafng \u0111\u1ea7u ti\u00ean, lu\u00f4n th\u1ec3 hi\u1ec7n \u0111\u01b0\u1ee3c s\u1ef1 m\u1ea1nh m\u1ebd, uy phong l\u00e0 phong c\u00e1ch v\u00e0 c\u1ed1t c\u00e1ch c\u1ee7a c\u00e1c b\u1eadc l\u00e0m quan.", "sex": 3}
{"first_name": "\u0110\u1ee9c Oai", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \u0110\u1ee9c t\u1ee9c l\u00e0 ph\u1ea9m h\u1ea1nh, t\u00e1c phong t\u1ed1t \u0111\u1eb9p, quy ph\u1ea1m m\u00e0 con ng\u01b0\u1eddi ph\u1ea3i tu\u00e2n theo, ch\u1ec9 chung nh\u1eefng vi\u1ec7c t\u1ed1t l\u00e0nh l\u1ea5y \u0111\u1ea1o \u0111\u1ec3 l\u1eadp th\u00e2n. \u0110\u1ee9c Oai \u0111\u01b0\u1ee3c Ghe\u0301p l\u1ea1i ta\u0323o tha\u0300nh t\u00ean \u0110\u01b0\u0301c Oai cho con ha\u0300m y\u0301 b\u00f4\u0301 me\u0323 mong con sau na\u0300y se\u0303 la\u0300 \u0111\u00e2\u0301ng nam nhi s\u00f4\u0301ng \u0111\u01b0\u0301ng \u0111\u0103\u0301n, ngay th\u0103\u0309ng va\u0300 \u0111\u01b0\u0301c \u0111\u00f4\u0323,  \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng", "sex": 3}
{"first_name": "Duy Oai", "meaning": "Duy trong ti\u1ebfng h\u00e1n vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u01b0 duy, suy ngh\u0129 th\u1ea5u \u0111\u00e1o. Ng\u01b0\u1eddi t\u00ean \"Duy Oai\" th\u01b0\u1eddng bi\u1ebft b\u00ecnh t\u0129nh gi\u1ea3i quy\u1ebft v\u1ea5n \u0111\u1ec1 kh\u00f4ng b\u1ed9p ch\u1ed9p h\u00e0nh x\u1eed, c\u00f3 tr\u00ed tu\u1ec7, th\u00f4ng minh & tinh t\u01b0\u1eddng", "sex": 5}
{"first_name": "Gia Oai", "meaning": "Gia theo ti\u1ebfng H\u00e1n - Vi\u1ec7t l\u00e0 lo\u00e0i c\u1ecf lau, mang l\u1ea1i \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p, ph\u00fac l\u00e0nh. \"Gia Oai\" ng\u1ee5 \u00fd con lu\u00f4n nh\u1edb v\u1ec1 gia \u0111\u00ecnh, l\u00e0 m\u00e1i nh\u00e0 n\u01a1i m\u1ecdi ng\u01b0\u1eddi sum v\u1ea7y, sinh ho\u1ea1t b\u00ean nhau, m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng \u0111\u00f9m b\u1ecdc l\u1eabn nhau.", "sex": 7}
{"first_name": "Ho\u00e0ng Oai", "meaning": "\"Ho\u00e0ng\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi v\u0129 \u0111\u1ea1i, c\u00f3 c\u1ed1t c\u00e1ch v\u01b0\u01a1ng gi\u1ea3, v\u1edbi mong mu\u1ed1n t\u01b0\u01a1ng lai ph\u00fa qu\u00fd, sang gi\u00e0u. \"Ho\u00e0ng Oai\"l\u00e0 t\u00ean hay \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con c\u00f3 \u00fd ngh\u0129a l\u00e0 s\u00e1ng su\u1ed1t, th\u00f4ng minh, th\u00e0nh \u0111\u1ea1t, v\u1ebb vang v\u00e0 t\u1ea1o \u0111\u01b0\u1ee3c \u1ea3nh h\u01b0\u1edfng l\u1edbn \u0111\u1ed1i v\u1edbi nh\u1eefng ng\u01b0\u1eddi kh\u00e1c, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau m\u1ebfn, kh\u00e2m ph\u1ee5c, ng\u01b0\u1ee1ng m\u1ed9.", "sex": 3}
{"first_name": "Khang Oai", "meaning": "Khang Oai trong mong mu\u1ed1n cho gia \u0111\u00ecnh lu\u00f4n \u0111\u01b0\u1ee3c b\u00ecnh an, m\u1ea1nh kho\u1ebb, nh\u00e0 c\u1eeda sung t\u00fac, c\u00f3 nhi\u1ec1u t\u00e0i l\u1ed9c, l\u00e0m \u0103n ng\u00e0y c\u00e0ng kh\u1ea5m kh\u00e1.", "sex": 3}
{"first_name": "Kh\u00e1nh Oai", "meaning": "Kh\u00e1nh l\u00e0 t\u1ed1t \u0111\u1eb9p. Kh\u00e1nh Oai l\u00e0 th\u1ea5u hi\u1ec3u \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p, th\u00f4ng su\u1ed1t l\u00fd l\u1ebd v\u00e0 h\u00e0nh \u0111\u1ed9ng gan d\u1ea1, t\u00e0i m\u01b0u l\u01b0\u1ee3c.", "sex": 7}
{"first_name": "Kim Oai", "meaning": "Kim Oai l\u00e0 c\u00e1i t\u00ean ti\u1ebfng Vi\u1ec7t c\u00f3 th\u1ec3 \u0111\u1eb7t cho c\u1ea3 trai v\u00e0 g\u00e1i. V\u1edbi ch\u1eef Kim thu\u1ed9c nh\u00f3m \u0111\u00e1 qu\u00fd c\u00f3 ngh\u0129a l\u00e0 s\u00e1ng s\u1ee7a, t\u1ecfa s\u00e1ng, s\u00e1ng l\u1ea1n. \"Kim Oai\" \u00fd ch\u1ec9 ng\u01b0\u1eddi con c\u00f3 t\u01b0\u01a1ng lai s\u00e1ng l\u1ea1n, r\u1ea1ng ng\u01b0\u1eddi v\u00e0 cu\u1ed9c s\u1ed1ng g\u1eb7p nhi\u1ec1u b\u00ecnh an, may m\u1eafn", "sex": 7}
{"first_name": "K\u1ef3 Oai", "meaning": "T\u00ean An theo ngh\u0129a H\u00e1n Vi\u1ec7t m\u00f4\u0323c t\u01b0\u0301c l\u00e0 m\u00f4\u0323c ma\u0323c co\u0301 nghi\u0303a bi\u0300nh di\u0323, ch\u00e2\u0301t pha\u0301c. K\u00ea\u0301t h\u01a1\u0323p M\u00f4\u0323c va\u0300 Oai \u0111\u0103\u0323t t\u00ean cho con th\u00ea\u0309 hi\u00ea\u0323n ti\u0301nh khi\u0301 hi\u00ea\u0300n ho\u0300a, gia\u0309n di\u0323 \u01a1\u0309 con ma\u0300 b\u00f4\u0301 me\u0323 mong mu\u00f4\u0301n. M\u1ed9c Oai c\u00f2n th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi m\u1ea1nh m\u1ebd, n\u1ed9i l\u1ef1c tr\u00e0n \u0111\u1ea7y th\u00edch gi\u00fap \u0111\u1ee1 nh\u1eefng ng\u01b0\u1eddi y\u00eau h\u01a1n m\u00ecnh.", "sex": 3}
{"first_name": "Long Oai", "meaning": "\"Long Oai\" \u0111\u01b0\u1ee3c l\u1ef1a ch\u1ecdn \u0111\u1eb7t t\u00ean cho con, b\u1ed1 m\u1eb9 g\u1eedi g\u1eafm con mang th\u00e2n ph\u1eadn d\u00f2ng d\u00f5i cao qu\u00fd v\u00e0 c\u00f3 s\u1ed1 m\u1ec7nh may m\u1eafn, tr\u00e1nh m\u1ecdi tai \u01b0\u01a1ng hi\u1ec3m h\u1ecda v\u00e0 lu\u00f4n c\u00f3 s\u1ef1 t\u0129nh l\u1eb7ng c\u1ea7n thi\u1ebft. V\u00ec v\u1eady, b\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean theo nguy\u00ean qu\u00e1n cho con v\u1edbi \u00fd ni\u1ec7m t\u01b0\u1edfng nh\u1edb v\u1ec1 qu\u00ea nh\u00e0, ho\u1eb7c n\u01a1i ghi d\u1ea5u k\u1ef7 ni\u1ec7m n\u01a1i con sinh ra \u0111\u1eddi. Long Oai th\u01b0\u1eddng c\u00f3 t\u01b0\u1edbng m\u1ec7nh c\u1ee7a r\u1ed3ng, th\u1ec3 hi\u1ec7n l\u00e0 con ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, b\u1ea3n l\u0129nh.", "sex": 3}
{"first_name": "M\u1ea1nh Oai", "meaning": "Nh\u01b0 chi\u0301nh trong t\u00ean go\u0323i: Ma\u0323nh cu\u0309a kho\u0309e ma\u0323nh, ca\u0301i t\u00ean Ma\u0323nh Oai \u0111\u01b0\u01a1\u0323c b\u00f4\u0301 me\u0323 \u0111\u0103\u0323t cho con v\u01a1\u0301i mong \u01b0\u01a1\u0301c con trai mi\u0300nh co\u0301 th\u00ea\u0309 pha\u0301ch c\u01b0\u01a1\u0300ng tra\u0301ng \u0111\u0103\u0323c thu\u0300 cu\u0309a nam gi\u01a1\u0301i va\u0300 ph\u00e2\u0309m ca\u0301ch cao quy\u0301, y\u0301 chi\u0301 ki\u00ean c\u01b0\u01a1\u0300ng.", "sex": 3}
{"first_name": "Minh Oai", "meaning": "Minh l\u00e0 s\u00e1ng t\u1ecf, \u00e1nh s\u00e1ng. Minh Oai l\u00e0 k\u00fd t\u1ef1 \u0111\u1ea7u ti\u00ean \u0111\u1eb9p \u0111\u1ebd, th\u1ec3 hi\u1ec7n t\u00ecnh y\u00eau th\u01b0\u01a1ng cha m\u1eb9 v\u1edbi con c\u00e1i, mong con c\u00e1i kh\u1ecfe m\u1ea1nh v\u00e0 c\u00f3 m\u1ed9t cu\u1ed9c s\u1ed1ng h\u1ea1nh ph\u01b0\u1edbc tr\u00e0n \u0111\u1ea7y.", "sex": 3}
