{"first_name": "Nam Oai", "meaning": "Nam t\u01b0\u0301c m\u1ed9t ph\u01b0\u01a1ng trong b\u1ed1n ph\u01b0\u01a1ng (ph\u01b0\u01a1ng Nam). \u0110\u0103\u0323t t\u00ean Nam Oai cho con nh\u01b0 hoa\u0300i ni\u00ea\u0323m hay g\u01b0\u0309i g\u0103\u0301m mong mu\u00f4\u0301n v\u00ea\u0300 vu\u0300ng \u0111\u00e2\u0301t ph\u01b0\u01a1ng Nam an la\u0323c, n\u01a1i b\u00f4\u0301 me\u0323 ch\u01b0a tro\u0323n hay kha\u0301t vo\u0323ng d\u01a1\u0309 dang va\u0300 mong mu\u00f4\u0301n con trai mi\u0300nh se\u0303 co\u0301 \u0111u\u0309 chi\u0301 h\u01b0\u01a1\u0301ng, hoa\u0300i ba\u0303o nam nhi \u0111\u00ea\u0309 k\u00ea\u0301 tu\u0323c.", "sex": 3}
