{"first_name": "Nguy\u00ean Oai", "meaning": "Nguy\u00ean Oai l\u00e0 m\u1ed9t c\u00e1i t\u00ean \u0111\u1eb9p \u0111\u1ec3 \u0111\u1eb7t cho con g\u00e1i l\u00e2\u0303n con trai v\u1edbi \u00fd ngh\u0129a con l\u00e0 ng\u01b0\u1eddi hi\u00ea\u0300n ho\u0300a, gi\u00e0u \u0111\u1ee9c h\u1ea1nh & t\u00e2m h\u1ed3n trong s\u00e1ng, nguy\u00ean v\u1eb9n tr\u00f2n \u0111\u1ea7y.", "sex": 3}
{"first_name": "Nguy\u1ec7t Oai", "meaning": "\"Nguy\u1ec7t\" c\u00f3 ngh\u0129a l\u00e0  tr\u0103ng, \u00e1nh tr\u0103ng, th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 v\u00ed von so s\u00e1nh v\u1edbi v\u1ebb \u0111\u1eb9p c\u1ee7a ng\u01b0\u1eddi con g\u00e1i.V\u1edbi t\u00ean \"Nguy\u1ec7t Oai\", b\u1ed1 m\u1eb9 hi v\u1ecdng con s\u1ebd nh\u01b0 v\u1ea7ng tr\u0103ng lu\u00f4n r\u1ef1c r\u1ee1 khi tr\u00f2n, khi khuy\u1ebft  l\u00e0m lay \u0111\u1ed9ng tr\u00e1i tim c\u1ee7a bi\u1ebft bao ng\u01b0\u1eddi, ai c\u0169ng s\u1ebd y\u00eau m\u1ebfn con.", "sex": 5}
{"first_name": "Nh\u00e2n Oai", "meaning": "\"Nh\u00e2n Oai\" l\u00e0 m\u1ed9t t\u1eeb H\u00e1n Vi\u1ec7t \u00fd ch\u1ec9 nh\u00e2n ngh\u0129a l\u00e0m ng\u01b0\u1eddi, ch\u1ec9 con ng\u01b0\u1eddi s\u1ed1ng trong x\u00e3 h\u1ed9i, s\u1ed1ng tr\u00ean tr\u00e1i \u0111\u1ea5t n\u00e0y lu\u00f4n c\u1ea7n c\u00f3 l\u00f2ng y\u00eau th\u01b0\u01a1ng \u0111\u1ed3ng lo\u1ea1i, mong mu\u1ed1n con s\u1ebd c\u00f3 nh\u1eefng h\u00e0nh \u0111\u1ed9ng nh\u01b0 gi\u00fap \u0111\u1ee1 ng\u01b0\u1eddi g\u1eb7p kh\u00f3 kh\u0103n, t\u00edch c\u1ef1c l\u00e0m c\u00e1c vi\u1ec7c t\u1ed1t cho x\u00e3 h\u1ed9i.", "sex": 7}
{"first_name": "Nh\u1ea5t Oai", "meaning": "Nh\u1ea5t l\u00e0 s\u1ed1 m\u1ed9t, \u0111\u1ea7u ti\u00ean. Nh\u1ea5t Oai c\u00f3 ngh\u0129a l\u00e0 v\u1ecb th\u1ee9 t\u1ed1t nh\u1ea5t, d\u1eabn \u0111\u1ea7u nh\u1edd v\u00e0o \u00fd ch\u00ed m\u1ea1nh m\u1ebd, ki\u00ean \u0111\u1ecbnh lu\u00f4n mu\u1ed1n kh\u1eb3ng \u0111\u1ecbnh b\u1ea3n th\u00e2n.", "sex": 3}
{"first_name": "Nh\u1eadt Oai", "meaning": "Nh\u1eadt l\u00e0 m\u1eb7t tr\u1eddi, ban ng\u00e0y. Nh\u1eadt Oai c\u00f3 ngh\u0129a l\u00e0 ng\u00e0y \u0111\u1ea7u ti\u00ean, m\u1eb7t tr\u1eddi \u0111\u1ea7u ti\u00ean, h\u00e0m ngh\u0129a l\u1eddi ch\u00fac ph\u00fac t\u1ed1t \u0111\u1eb9p cho cu\u1ed9c \u0111\u1eddi. Ch\u00fac cho nh\u1eefng ng\u01b0\u1eddi c\u00f3 ch\u00ed l\u1edbn lu\u00f4n v\u1eefng t\u00e2m l\u00e0m vi\u1ec7c th\u1ec3 hi\u1ec7n \u0111\u01b0\u1ee3c nguy\u1ec7n v\u1ecdng c\u1ee7a b\u1ea3n th\u00e2n.", "sex": 3}
{"first_name": "Phi Oai", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Phi\" l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn v\u1ee3 c\u1ee7a vua, quan ng\u00e0y x\u01b0a, \u00fd ch\u1ec9 s\u1ef1 quy\u1ec1n qu\u00fd, cao sang. \u0110\u1eb7t t\u00ean con l\u00e0 \"Phi Oai\" v\u1edbi mong mu\u1ed1n con lu\u00f4n xinh \u0111\u1eb9p, \u0111oan trang, \u0111\u01b0\u1ee3c y\u00eau th\u01b0\u01a1ng v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng h\u00f4n nh\u00e2n th\u1eadt h\u1ea1nh ph\u00fac trong t\u01b0\u01a1ng lai.", "sex": 3}
{"first_name": "Phong Oai", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Phong\" c\u00f3 ngh\u0129a l\u00e0 gi\u00f3. \"Phong Oai\" \u00fd n\u00f3i \u0111\u1ebfn nh\u1eefng con gi\u00f3 nh\u1eb9, thanh b\u00ecnh, m\u00e1t r\u01b0\u1ee3i, l\u00e0m l\u00f2ng ng\u01b0\u1eddi th\u01b0 th\u00e1i. T\u00ean \"Phong Oai\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd l\u00e0 ng\u01b0\u1eddi con trai t\u00e0i ba, gi\u1ecfi giang, cu\u1ed9c s\u1ed1ng c\u1ee7a con lu\u00f4n b\u00ecnh an va tr\u00e0n ng\u1eadp ni\u1ec1m vui, h\u1ea1nh ph\u00fac trong cu\u1ed9c s\u1ed1ng.", "sex": 3}
