{"first_name": "Quang Oai", "meaning": "Quang c\u00f3 ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng. Quang Oai c\u00f3 ngh\u0129a l\u00e0 qu\u1ea7ng s\u00e1ng ti\u1ebfp theo, c\u00f3 t\u00ednh ch\u1ea5t ch\u00f3i l\u1ecdi h\u01a1n, b\u1ec1n v\u1eefng h\u01a1n, ho\u1eb7c c\u00f3 ngh\u0129a k\u1ebf t\u1ee5c tinh th\u1ea7n quang minh l\u1ed7i l\u1ea1c c\u1ee7a c\u00e1c b\u1eadc ti\u1ec1n nh\u00e2n x\u01b0a kia, th\u1ec3 hi\u1ec7n tinh th\u1ea7n ho\u00e0n thi\u1ec7n v\u00e0 m\u1ea1nh m\u1ebd h\u01a1n.", "sex": 3}
{"first_name": "Qu\u1ed1c Oai", "meaning": "\"Qu\u1ed1c\" l\u00e0 n\u01b0\u1edbc nh\u00e0. \"Qu\u1ed1c Oai\" ngh\u0129a l\u00e0 uy phong c\u1ee7a n\u01b0\u1edbc nh\u00e0, ng\u1ee5 \u00fd cha m\u1eb9 mong con tr\u1edf th\u00e0nh ng\u01b0\u1eddi c\u00f3 t\u00e0i kinh bang t\u1ebf th\u1ebf, r\u01b0\u1eddng c\u1ed9t n\u01b0\u1edbc nh\u00e0.", "sex": 3}
{"first_name": "S\u01b0\u01a1ng Oai", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t,\"S\u01b0\u01a1ng\" g\u1ee3i \u0111\u1ebfn h\u00ecnh \u1ea3nh gi\u1ecdt s\u01b0\u01a1ng trong su\u1ed1t thanh khi\u1ebft, \u0111\u1ecdng l\u1ea1i tr\u00ean nh\u1eefng chi\u1ebfc l\u00e1 v\u00e0 tr\u1edf n\u00ean huy\u1ec1n \u1ea3o khi c\u00f3 \u00e1nh m\u1eb7t tr\u1eddi soi chi\u1ebfu. T\u00ean \"S\u01b0\u01a1ng Oai\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd xinh \u0111\u1eb9p, t\u00e2m h\u1ed3n trong s\u00e1ng, y\u00eau \u0111\u1eddi, lu\u00f4n vui t\u01b0\u01a1i v\u00e0 h\u1ea1nh ph\u00fac", "sex": 5}
