{"first_name": "Th\u00e1i Oai", "meaning": "\"Th\u00e1i\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 hanh th\u00f4ng, thu\u1eadn l\u1ee3i, th\u1ec3 hi\u1ec7n s\u1ef1 y\u00ean vui. Ngo\u00e0i ra \"Th\u00e1i\" c\u00f2n \u00fd ch\u1ec9 v\u1ec1 th\u00e1i \u0111\u1ed9 s\u1ed1ng c\u1ee7a con ng\u01b0\u1eddi. T\u00ean \"Th\u00e1i Oai\" c\u00f3 \u00fd ngh\u0129a l\u00e0 cha m\u1eb9 mong con c\u00f3 t\u00e2m h\u1ed3n b\u00ecnh d\u1ecb, kh\u00f4ng h\u01a1n thua, s\u1ed1ng trong s\u1ef1 an nhi\u00ean t\u1ef1 t\u1ea1i, th\u01b0 th\u00e1i ung dung c\u1ee7a c\u00e1c b\u1eadc nho s\u0129.", "sex": 3}
