{"first_name": "Th\u1ea3o Oai", "meaning": "\"Th\u1ea3o Oai\" c\u00f3 ngh\u0129a l\u00e0 ng\u1ecdn c\u1ecf nh\u1ecf nh\u1eafn xinh x\u1eafn, m\u1ea1nh m\u1ebd v\u00e0 th\u00f4ng minh, c\u00f3 \u0111\u01b0\u1ee3c ni\u1ec1m vui an nhi\u00ean t\u1ef1 t\u1ea1i c\u00f9ng tr\u1eddi \u0111\u1ea5t.", "sex": 5}
{"first_name": "Th\u1ebf Oai", "meaning": "Con la\u0300 s\u01b0\u0323 an la\u0300nh c\u1ee7a cu\u1ed9c \u0111\u1eddi, con mang \u0111\u00ea\u0301n cho b\u00f4\u0301 me\u0323 s\u01b0\u0323 bi\u0300nh y\u00ean, \u00eam \u0111\u00ea\u0300m nh\u01b0 chi\u0301nh t\u00ean go\u0323i.  V\u00ec v\u1eady \u0111\u0103\u0323t t\u00ean Th\u00ea\u0301 Oai cho con, \u0111\u00f3 l\u00e0 ngu\u0323 y\u0301 b\u00f4\u0301 m\u1eb9 mong mu\u1ed1n con cu\u0303ng c\u00f3 m\u1ed9t s\u1ed1 m\u1ec7nh may m\u1eafn, tr\u00e1nh m\u1ecdi tai \u01b0\u01a1ng hi\u1ec3m h\u1ecda v\u00e0 lu\u00f4n c\u00f3 s\u1ef1 t\u0129nh l\u1eb7ng c\u1ea7n thi\u1ebft. Nh\u01b0ng c\u0169ng v\u1eabn c\u00f3 kh\u00ed ch\u1ea5t c\u1ee7a m\u1ed9t b\u1eadc anh t\u00e0i \u0111\u1ec3 th\u00e0nh ng\u01b0\u1eddi uy danh l\u1ed7i l\u1ea1c \u0111\u01b0\u1ee3c s\u1ef1 n\u1ec3 tr\u1ecdng c\u1ee7a nhi\u1ec1u ng\u01b0\u1eddi.", "sex": 3}
{"first_name": "Thi\u00ean Oai", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t Thi\u00ean c\u00f3 ngh\u0129a l\u00e0 tr\u1eddi. C\u00e1i t\u00ean mang \u00fd ngh\u0129a sau n\u00e0y con s\u1ebd th\u00f4ng minh, xu\u1ea5t ch\u00fang, l\u00e0 t\u1ea5m g\u01b0\u01a1ng s\u00e1ng \u0111\u1ec3 m\u1ecdi ng\u01b0\u1eddi noi theo, \u0111\u01b0\u01a1\u0323c mo\u0323i ng\u01b0\u01a1\u0300i y\u00eau th\u01b0\u01a1ng, quy\u0301 tro\u0323ng.", "sex": 3}
{"first_name": "Thi\u1ec7n Oai", "meaning": "\"Thi\u1ec7n\" th\u01b0\u01a1\u0300ng du\u0300ng \u0111\u00ea\u0309 chi\u0309 l\u00e0 ng\u01b0\u1eddi t\u1ed1t, c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, th\u1ec3 hi\u1ec7n t\u00ecnh th\u01b0\u01a1ng bao la b\u00e1c \u00e1i, th\u01b0\u01a1ng ng\u01b0\u1eddi. Thi\u1ec7n Oai l\u00e0 m\u1ed9t c\u00e1i t\u00ean hay v\u00e0 \u00fd ngh\u0129a, \u1ea9n ch\u1ee9a mong mu\u1ed1n, k\u1ef3 v\u1ecdng c\u1ee7a cha m\u1eb9 v\u00e0o \u0111\u1ee9a con y\u00eau qu\u00fd, th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho c\u00e1c b\u00e9 trai kh\u1ecfe m\u1ea1nh kh\u00f4ng b\u1ecb \u1ed1m \u0111au b\u1ec7nh t\u1eadt.", "sex": 3}
{"first_name": "Thu\u1eadn Oai", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thu\u1eadn\" c\u00f3 ngh\u0129a l\u00e0 noi theo, hay l\u00e0m theo \u0111\u00fang quy lu\u1eadt, l\u00e0 h\u00f2a thu\u1eadn, hi\u1ebfu thu\u1eadn.  \u0110\u0103\u0323t t\u00ean con la\u0300 Thu\u00e2\u0323n Oai, b\u00f4\u0301 me\u0323 mong con s\u1ebd ngoan ngo\u00e3n, bi\u1ebft v\u00e2ng l\u1eddi, hi\u1ebfu th\u1ea3o v\u1edbi \u00f4ng b\u00e0, cha m\u1eb9, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng m\u1ecdi ng\u01b0\u1eddi.", "sex": 3}
{"first_name": "Ti\u1ec3u Oai", "meaning": "\u0110\u00e2y l\u00e0 t\u00ean ph\u1ed5 bi\u1ebfn d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i, \u00fd mu\u1ed1n noi con l\u00e0 thi\u00ean th\u1ea7n y\u00eau qu\u00fd b\u00e9 nh\u1ecf c\u1ee7a b\u1ed1 m\u1eb9, mong con lu\u00f4n c\u00f3 cu\u1ed9c s\u1ed1ng kh\u1ecfe m\u1ea1nh, vui t\u01b0\u01a1i v\u00e0 b\u00ecnh y\u00eau, kh\u00f4ng g\u1eb7p nhi\u1ec1u s\u00f3ng gi\u00f3 trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
{"first_name": "T\u1ed1 Oai", "meaning": "Con g\u00e1i xinh \u0111\u1eb9p c\u1ee7a b\u1ed1 m\u1eb9 s\u1ebd lu\u00f4n y\u00ean \u1ed5n, tr\u1ecdn v\u1eb9n v\u1edbi cu\u1ed9c s\u1ed1ng trong s\u1ea1ch \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi xung quanh y\u00eau m\u1ebfn v\u00e0 gi\u00fap \u0111\u1ee1.", "sex": 5}
{"first_name": "Tr\u00ed Oai", "meaning": "Tri\u0301 y\u0301 chi\u0309 tri\u0301 tu\u00ea\u0323, s\u01b0\u0323 khai sa\u0301ng. \u0110\u0103\u0323t t\u00ean con la\u0300 Tri\u0301 Oai, b\u00f4\u0301 me\u0323 th\u00e2\u0300m mong mu\u00f4\u0301n con th\u00f4ng minh h\u01a1n ng\u01b0\u01a1\u0300i, ph\u00e2\u0309m ca\u0301ch cao quy\u0301 hi\u00ea\u0300n ho\u0300a, ngu\u0323 y\u0301 con s\u01a1\u0309 h\u01b0\u0303u ta\u0300i \u0111\u01b0\u0301c song toa\u0300n v\u00e0 c\u00f3 m\u1ed9t s\u1ed1 m\u1ec7nh t\u1ed1t.", "sex": 3}
{"first_name": "Tr\u1ecdng Oai", "meaning": "\"Tr\u1ecdng\" theo nghi\u0303a Ha\u0301n - Vi\u00ea\u0323t l\u00e0 ng\u01b0\u1eddi bi\u1ebft qu\u00fd tr\u1ecdng l\u1ebd ph\u1ea3i, s\u1ed1ng \u0111\u1ea1o l\u00fd, \u0111\u1ee9ng \u0111\u1eafn, lu\u00f4n ch\u1ecdn con \u0111\u01b0\u1eddng ngay th\u1eb3ng.\"\u00c1i\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. V\u00ec v\u1eady, t\u00ean \"Tr\u1ecdng \u00c1i\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 c\u1ed1t c\u00e1ch thanh cao, bi\u1ebft ph\u00e2n \u0111\u1ecbnh r\u1ea1ch r\u00f2i, s\u1ed1ng c\u00f3 \u0111\u1ea1o l\u00fd, c\u00f3 t\u00ecnh ngh\u0129a, c\u00f3 t\u1ea5m l\u00f2ng bao dung, \u0111\u1ed9 l\u01b0\u1ee3ng \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng", "sex": 3}
{"first_name": "Tu\u1ec7 Oai", "meaning": "\u0110\u00e2y l\u00e0 t\u00ean hay c\u00f3 th\u1ec3 d\u00f9ng cho c\u1ea3 con trai v\u00e0 con g\u00e1i v\u1edbi \"Tu\u1ec7\" ngh\u0129a l\u00e0 tr\u00ed th\u00f4ng minh, tr\u00ed tu\u1ec7.B\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean con th\u1ebf n\u00e0y v\u1edbi mong mu\u1ed1n \u0111\u1ee9a tr\u1ebb sinh ra s\u1ebd l\u00e0 m\u1ed9t ng\u01b0\u1eddi bi\u1ebft \u0111i\u1ec1u, ph\u1ea9m h\u1ea1nh cao qu\u00fd, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng.", "sex": 5}
