{"first_name": "Tuy\u1ebft Oai", "meaning": "\u0110\u00e2y l\u00e0 b\u00ean ph\u1ed5 bi\u1ebfn th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i \u1edf Vi\u1ec7t Nam v\u1edbi \"Tuy\u1ebft\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eafng, tinh kh\u00f4i, \u0111\u1eb9p \u0111\u1ebd. T\u00ean \"Tuy\u1ebft Oai\" v\u1edbi \u00fd ngh\u0129a con l\u00e0 thi\u00ean th\u1ea7n nh\u1ecf b\u00e9, tinh kh\u00f4i, lu\u00f4n mang \u0111\u1ebfn b\u00ecnh an cho b\u1ed1 m\u1eb9.", "sex": 5}
{"first_name": "V\u00e2n Oai", "meaning": "\"V\u00e2n\" c\u00f3 ngh\u0129a l\u00e0 m\u00e2y, th\u1ec3 hi\u1ec7n s\u1ef1 nh\u1eb9 nh\u00e0ng, t\u1ef1 do t\u1ef1 t\u1ea1i. \"V\u00e2n Oai\" c\u00f3 ngh\u0129a l\u00e0 mong mu\u1ed1n cu\u1ed9c s\u1ed1ng c\u1ee7a con s\u1ebd an nhi\u00ean, t\u1ef1 t\u1ea1i, thong dong, b\u00ecnh y\u00ean nh\u01b0 \u00e1ng m\u00e2y tr\u00ean tr\u1eddi", "sex": 7}
