{"first_name": "\u0110\u1ee9c Kh\u1ea3i", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\u0110\u1ee9c\" t\u1ee9c l\u00e0 ph\u1ea9m h\u1ea1nh, t\u00e1c phong t\u1ed1t \u0111\u1eb9p, quy ph\u1ea1m m\u00e0 con ng\u01b0\u1eddi ph\u1ea3i tu\u00e2n theo, ch\u1ec9 chung nh\u1eefng vi\u1ec7c t\u1ed1t l\u00e0nh l\u1ea5y \u0111\u1ea1o \u0111\u1ec3 l\u1eadp th\u00e2n. \"Kh\u1ea3i\" c\u00f3 ngh\u0129a l\u00e0 vui m\u1eebng, h\u00e2n hoan. T\u00ean \"\u0110\u1ee9c Kh\u1ea3i\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi vui v\u1ebb, ho\u1ea1t b\u00e1t, c\u00f3 t\u1ea5m l\u00f2ng nh\u00e2n h\u1eadu, t\u1ed1t b\u1ee5ng, t\u1ed1t t\u00ednh, vui v\u1ebb, h\u00f2a \u0111\u1ed3ng.", "sex": 3}
