{"first_name": "M\u1ea1nh Kh\u1ea3i", "meaning": "\"M\u1ea1nh\" l\u00e0 s\u1ef1 m\u1ea1nh m\u1ebd, th\u1ec3 hi\u1ec7n s\u1ee9c m\u1ea1nh v\u00e0 ch\u1eafc ch\u1eafc. \"Kh\u1ea3i\" l\u00e0 kh\u00fac ca vui v\u1ebb, th\u1ec3 hi\u1ec7n ni\u1ec1m vui, s\u1ef1 chi\u1ebfn th\u1eafng. T\u00ean \"M\u1ea1nh Kh\u1ea3i\" th\u01b0\u1eddng \u0111\u1eb7t cho con trai v\u1edbi mong mu\u1ed1n con c\u00f3 t\u00ednh c\u00e1ch m\u1ea1nh m\u1ebd, vui t\u01b0\u01a1i, lu\u00f4n tr\u00e0n \u0111\u1ea7y nhi\u1ec7t huy\u1ebft", "sex": 3}
