{"first_name": "Tri\u1ec7u Kh\u1ea3i", "meaning": "\"Kh\u1ea3i\" trong H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 vui m\u1eebng, h\u00e2n hoan. Kh\u1ea3i Tri\u1ec7u c\u00f3 th\u1ec3 hi\u1ec3u l\u00e0 s\u1ef1 kh\u1edfi \u0111\u1ea7u t\u1ed1t \u0111\u1eb9p. T\u00ean \"Tri\u1ec7u Kh\u1ea3i \" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi vui v\u1ebb, ho\u1ea1t b\u00e1t, n\u0103ng \u0111\u1ed9ng, li\u00ean tay li\u00ean ch\u00e2n nh\u01b0 \u0111o\u00e0n qu\u00e2n v\u1eeba th\u1eafng tr\u1eadn tr\u1edf v\u1ec1 ca l\u00ean nh\u1eefng kh\u00fac ca vui nh\u1ed9n khi\u1ebfn m\u1ecdi ng\u01b0\u1eddi xung quanh c\u0169ng h\u00f2a theo nh\u1ecbp m\u00faa h\u00e1t  r\u1ed9n r\u00e0ng", "sex": 3}
