{"first_name": "L\u00e2m M\u1eabn", "meaning": "L\u00e2m l\u00e0 to l\u1edbn, l\u00e0 nh\u1eefng \u0111i\u1ec1u v\u1eefng ch\u1eafc. M\u1eabn l\u00e0 c\u1ea7n m\u1eabn. V\u1edbi c\u00e1i t\u00ean n\u00e0y b\u1ed1 m\u1eb9 mong mu\u1ed1n con lu\u00f4n si\u00eang n\u0103ng, t\u00edch \u0111i\u1ec3u th\u00e0nh \u0111\u1ea1i v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng v\u1eefng ch\u1eafc nh\u01b0 th\u00e1i s\u01a1n.", "sex": 5}
