{"first_name": "Minh M\u1eabn", "meaning": "\"Minh\" c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, t\u00e0i tr\u00ed. \"M\u1eabn\" c\u00f3 ngh\u0129a l\u00e0 si\u00eang n\u0103ng, ch\u0103m ch\u1ec9. T\u00ean con l\u00e0 \"Minh M\u1eabn\" l\u00e0 mong mu\u1ed1n c\u1ee7a cha m\u1eb9 hy v\u1ecdng con m\u00ecnh sau n\u00e0y v\u1eeba c\u00f3 t\u00e0i v\u1eeba c\u00f3 \u0111\u1ee9c, v\u1eeba th\u00f4ng minh, s\u00e1ng d\u1ea1 v\u1eeba ki\u00ean tr\u00ec, c\u1ea7n m\u1eabn. \u0110\u1ec3 tr\u1edf th\u00e0nh ni\u1ec1m t\u1ef1 h\u00e0o c\u1ee7a cha m\u1eb9", "sex": 3}
