{"first_name": "Thu Anh", "meaning": "\"Thu\" t\u01b0\u0301c m\u00f9a thu, mu\u0300a co\u0301 ti\u00ea\u0301t tr\u01a1\u0300i di\u0323u ma\u0301t nh\u00e2\u0301t trong n\u0103m. Ch\u1eef \"Anh\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. T\u00ean \"Thu Anh\" g\u1ee3i l\u00ean v\u1ebb \u0111\u1eb9p hi\u1ec1n ho\u00e0 v\u00e0 d\u1ecbu d\u00e0ng gi\u1ed1ng m\u00f9a thu c\u00f9ng v\u1edbi \u0111\u1ee9c t\u00ednh th\u00f4ng minh, tinh anh c\u1ee7a con ng\u01b0\u1eddi.", "sex": 5}
