{"first_name": "V\u0129nh Anh", "meaning": "T\u00ean \"V\u0129nh\" mang \u00fd ngh\u0129a tr\u01b0\u1eddng t\u1ed3n, v\u0129nh vi\u1ec5n. Ch\u1eef \"Anh\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. \u0110\u0103\u0323t t\u00ean \"Vi\u0303nh Anh\" cho con, b\u00f4\u0301 me\u0323 th\u00ea\u0309 hi\u00ea\u0323n mong mu\u00f4\u0301n con se\u0303 lu\u00f4n lu\u00f4n ta\u0300i gio\u0309i, xu\u00e2\u0301t chu\u0301ng, tri\u0301 du\u0303ng h\u01a1n ng\u01b0\u01a1\u0300i.", "sex": 3}
