{"first_name": "V\u01b0\u01a1ng Anh", "meaning": "T\u00ean \"V\u01b0\u01a1ng\" g\u1ee3i c\u1ea3m gi\u00e1c cao sang, quy\u1ec1n qu\u00fd nh\u01b0 m\u1ed9t v\u1ecb vua. Ch\u1eef \"Anh\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n, v\u00ec v\u1eady t\u00ean \"V\u01b0\u01a1ng Anh\" th\u1ec3 hi\u1ec7n khi\u0301 pha\u0301ch xu\u00e2\u0301t chu\u0301ng, gio\u0309i giang cu\u0309a con, hi vo\u0323ng con trai mi\u0300nh ho\u00e0n thi\u1ec7n nh\u01b0\u0303ng \u0111i\u00ea\u0300u ch\u01b0a tro\u0300n cu\u0309a b\u00f4\u0301 me\u0323.", "sex": 3}
