{"first_name": "Xu\u00e2n Anh", "meaning": "\"Xu\u00e2n\" l\u00e0 m\u00f9a xu\u00e2n, m\u1ed9t m\u00f9a trong b\u1ed1n m\u00f9a xu\u00e2n, h\u1ea1, thu, \u0111\u00f4ng. M\u00f9a xu\u00e2n l\u00e0 m\u00f9a c\u1ee7a c\u00e2y c\u1ed1i \u0111\u00e2m ch\u1ed3i, n\u1ea3y l\u1ed9c, sinh s\u00f4i ph\u00e1t tri\u1ec3n. Ch\u1eef \"Anh\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. \"Xu\u00e2n Anh\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho con g\u00e1i, v\u1edbi mong \u01b0\u1edbc con l\u00fac n\u00e0o c\u0169ng vui t\u01b0\u01a1i, tr\u1ebb trung, xinh \u0111\u1eb9p, s\u1ee9c s\u1ed1ng c\u0103ng tr\u00e0n nh\u01b0 m\u00f9a xu\u00e2n.", "sex": 5}
{"first_name": "\u00dd Anh", "meaning": "\"\u00dd'' l\u00e0 m\u1ed9t c\u00e1i t\u00ean th\u01b0\u1eddng \u0111\u1eb7t cho con g\u00e1i , c\u00f3 ngh\u0129a l\u00e0 \u0111i\u1ec1u n\u1ea3y ra trong \u0111\u1ea7u \u00f3c m\u1ed7i ng\u01b0\u1eddi khi suy ngh\u0129 (\u00fd t\u1ed1t, \u00fd t\u01b0\u1edfng). Ch\u1eef \"Anh\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. \"\u00dd Anh\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean \u0111\u00e1ng y\u00eau d\u00e0nh cho c\u00e1c b\u00e9 g\u00e1i c\u00f3 ngh\u0129a l\u00e0 con l\u00e0 thi\u00ean th\u1ea7n nh\u1ecf b\u00e9, xinh \u0111\u1eb9p v\u00e0 \u0111\u00e1ng y\u00eau c\u1ee7a b\u00f4\u0301 me\u0323", "sex": 5}
{"first_name": "Y\u1ebfn Anh", "meaning": "\u00dd ch\u1ec9 \u0111\u00f4i chim qu\u00fd l\u00e0 chim y\u1ebfn v\u00e0 chim anh (hay c\u00f2n g\u1ecdi l\u00e0 chim oanh), hai gi\u1ed1ng chim th\u01b0\u1eddng bay t\u1eebng \u0111o\u00e0n. Ng\u01b0\u1eddi ta th\u01b0\u1eddng nh\u1eafc \u0111i\u1ec7u \u201coanh ca y\u1ebfn v\u0169\u201d \u0111\u1ec3 ch\u00e0o \u0111\u00f3n m\u00f9a xu\u00e2n v\u1ec1. \u0110\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho con, \"Y\u1ebfn Anh\" th\u1ec3 hi\u1ec7n s\u1ef1 y\u00ean \u1ed5n v\u00e0 vui v\u1ebb, kh\u00f4ng c\u00f3 vi\u1ec7c g\u00ec ph\u1ea3i lo ngh\u0129, cu\u1ed9c \u0111\u1eddi an nhi\u00ean v\u00e0 vui s\u01b0\u1edbng t\u1ef1 do.", "sex": 5}
