{"first_name": "B\u00ecnh Ng\u00e2n", "meaning": "B\u00ecnh Ng\u00e2n la\u0300 t\u00ean th\u01b0\u01a1\u0300ng hay du\u0300ng \u0111\u00ea\u0309 \u0111\u0103\u0323t t\u00ean cho be\u0301 ga\u0301i. Ng\u00e2n ngh\u0129a l\u00e0 ch\u00e2u b\u00e1u, l\u00e0 b\u1ea1c, d\u00f2ng s\u00f4ng, \u00e2m thanh vang xa. B\u00ecnh\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 c\u00f4ng b\u1eb1ng, ngang nhau kh\u00f4ng thi\u00ean l\u1ec7ch, c\u00f4ng ch\u00ednh.  T\u00ean Ng\u00e2n Bi\u0300nh c\u00f3 ngh\u0129a l\u00e0 con s\u1ebd l\u00e0 m\u1ed9t d\u00f2ng s\u00f4ng hi\u1ec1n h\u00f2a, xinh \u0111\u1eb9p. C\u00e1i t\u00ean Ng\u00e2n Bi\u0300nh mang \u00fd ngh\u0129a v\u1ec1 cu\u1ed9c s\u1ed1ng \u0111\u1ea7y \u0111\u1ee7 v\u1ec1 v\u1eadt ch\u1ea5t, l\u1eabn v\u1ebb \u0111\u1eb9p c\u1ee7a t\u1ea5m l\u00f2ng th\u01a1m th\u1ea3o, \u00f4n ho\u0300a", "sex": 5}
{"first_name": "B\u00f9i Ng\u00e2n", "meaning": "Ng\u00e2n l\u00e0 ti\u1ec1n c\u1ee7a. B\u00f9i c\u00f3 th\u1ec3 hi\u1ec3u \u0111\u01a1n gi\u1ea3n l\u00e0 1 d\u00f2ng h\u1ecd \u1edf VN. V\u1edbi B\u00f9i Ng\u00e2n th\u00ec ch\u1eef B\u00f9i ch\u1ec9 mang \u00fd l\u00e0 t\u00ean \u0111\u1ec7m, c\u00f2n ph\u1ea7n ngh\u0129a c\u1ee7a t\u00ean ch\u1ee7 y\u1ebfu trong ch\u1eef Ng\u00e2n, \u00fd n\u00f3i con s\u1ebd c\u00f3 cu\u1ed9c s\u1ed1ng sang gi\u00e0u sung t\u00fac, \u0111\u1ea7y ti\u1ec1n c\u1ee7a.", "sex": 3}
{"first_name": "Ch\u00e2u Ng\u00e2n", "meaning": "Ng\u00e2n l\u00e0 ti\u1ec1n c\u1ee7a. Ch\u00e2u l\u00e0 ch\u00e2u b\u00e1u ng\u1ecdc ng\u00e0 qu\u00fd gi\u00e1. Ch\u00e2u Ng\u00e2n ngh\u0129a l\u00e0 con s\u1ebd c\u00f3 cu\u1ed9c s\u1ed1ng sang gi\u00e0u, lu\u00f4n d\u01b0 da\u0309 v\u1eadt ch\u1ea5t, ch\u00e2u b\u00e1u, ti\u1ec1n t\u00e0i kh\u00f4ng thi\u1ebfu, kh\u00f4ng lo.", "sex": 5}
{"first_name": "Chi Ng\u00e2n", "meaning": "Ng\u00e2n l\u00e0 ti\u1ec1n c\u1ee7a. Chi trong \"kim chi ngoc di\u1ec7p\" \u00fd n\u00f3i con nh\u00e0 quy\u1ec1n qu\u00fd, sang gi\u00e0u. Chi Ng\u00e2n ngh\u0129a l\u00e0 con l\u00e0 c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc, kim chi ng\u1ecdc di\u1ec7p c\u1ee7a gia \u0111\u00ecnh, cha m\u1eb9 mong con lu\u00f4n gi\u00e0u sang, sung s\u01b0\u1edbng.", "sex": 5}
{"first_name": "Ch\u00ed Ng\u00e2n", "meaning": "Ng\u00e2n l\u00e0 ti\u1ec1n c\u1ee7a; ch\u00ed l\u00e0 \u00fd ch\u00ed ti\u1ebfn th\u1ee7, bi\u1ebft v\u01b0\u01a1n l\u00ean. Ch\u00ed Ng\u00e2n ngh\u0129a l\u00e0 con l\u00e0 ng\u01b0\u1eddi c\u00f3 ch\u00ed, quy\u1ebft ti\u1ebfn th\u00e2n, gi\u1ecfi giang & c\u00f3 cu\u1ed9c s\u1ed1ng \u0111\u1ee7 \u0111\u1ea7y, gi\u00e0u c\u00f3.", "sex": 5}
{"first_name": "Chu Ng\u00e2n", "meaning": "Ng\u00e2n l\u00e0 ti\u1ec1n c\u1ee7a. Chu l\u00e0 chu to\u00e0n, chu \u0111\u00e1o. Chu Ng\u00e2n ngh\u0129a l\u00e0 con c\u00f3 cu\u1ed9c s\u1ed1ng gi\u00e0u c\u00f3, bi\u1ebft lo toan m\u1ecdi vi\u1ec7c chu to\u00e0n.", "sex": 7}
{"first_name": "\u0110\u1ea1i Ng\u00e2n", "meaning": "Ng\u00e2n l\u00e0 ti\u1ec1n c\u1ee7a. \u0110\u1ea1i l\u00e0 to l\u1edbn, th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho ng\u01b0\u1eddi con trai ch\u1ec9 s\u1ef1 oai v\u1ec7, m\u1ea1nh m\u1ebd. \u0110\u1ea1i Ng\u00e2n c\u00f3 th\u1ec3 hi\u1ec3u l\u00e0 th\u1ecfi v\u00e0ng l\u1edbn, \u00fd n\u00f3i con s\u1ebd lu\u00f4n gi\u00e0u c\u00f3, to kh\u1ecfe, m\u1ea1nh m\u1ebd.", "sex": 3}
{"first_name": "\u0110\u0103ng Ng\u00e2n", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 qu\u00fd b\u00e1u. \"\u0110\u0103ng\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ng\u1ecdn \u0111\u00e8n, mang \u00fd ngh\u0129a l\u00e0 s\u1ef1 soi s\u00e1ng, tinh anh. V\u1edbi t\u00ean \"\u0110\u0103ng Ng\u00e2n\" cha m\u1eb9 mong con s\u1ebd l\u00e0 ng\u01b0\u1eddi gi\u1ecfi giang, t\u00e0i tr\u00ed, t\u01b0\u01a1ng lai sung s\u01b0\u1edbng sang gi\u00e0u.", "sex": 7}
{"first_name": "Dao Ng\u00e2n", "meaning": "Ng\u00e2n l\u00e0 ti\u1ec1n c\u1ee7a. Dao c\u0169ng l\u00e0 t\u00ean 1 lo\u1ea1i ng\u1ecdc \u0111\u1eb9p. T\u00ean Dao Ng\u00e2n mang \u00fd ngh\u0129a con xinh \u0111\u1eb9p nh\u01b0 ng\u1ecdc, thu\u1ea7n khi\u1ebft, trong s\u00e1ng & t\u01b0\u01a1ng lai gi\u00e0u c\u00f3, sung t\u00fac.", "sex": 5}
{"first_name": "Di Ng\u00e2n", "meaning": "Ng\u00e2n l\u00e0 ti\u1ec1n c\u1ee7a. Di l\u00e0 vui v\u1ebb, sung s\u01b0\u1edbng. Di Ng\u00e2n ngh\u0129a l\u00e0 cha m\u1eb9 mong con lu\u00f4n vui v\u1ebb, c\u00f3 cu\u1ed9c s\u1ed1ng gi\u00e0u c\u00f3 sung s\u01b0\u1edbng.", "sex": 5}
{"first_name": "Di\u1ec5m Ng\u00e2n", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 qu\u00fd b\u00e1u. \"Di\u1ec5m\" theo ti\u1ebfng H\u00e1n c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u1ed1t \u0111\u1eb9p, v\u1ebb t\u01b0\u01a1i s\u00e1ng, xinh \u0111\u1eb9p l\u1ed9ng l\u1eaby th\u01b0\u1eddng ng\u1ee5 \u00fd ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p, y\u1ec3u \u0111i\u1ec7u. V\u1edbi t\u00ean \"Di\u1ec5m Ng\u00e2n\", ba m\u1eb9 mong con xinh \u0111\u1eb9p, y\u1ec3u \u0111i\u1ec7u \u0111\u00e1ng y\u00eau v\u00e0 t\u01b0\u01a1ng lai gi\u00e0u sang sung t\u00fac.", "sex": 5}
{"first_name": "Di\u1ec7p Ng\u00e2n", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 qu\u00fd b\u00e1u. Theo ti\u1ebfng H\u00e1n- Vi\u1ec7t ch\u1eef \"Di\u1ec7p\" ch\u00ednh l\u00e0 \"l\u00e1\" trong Kim Chi Ng\u1ecdc Di\u1ec7p (d\u1ecbch l\u00e0 c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc). V\u00ec v\u1eady, \u0111\u1eb7t t\u00ean \" Di\u1ec7p Ng\u00e2n\" cho con ng\u1ee5  \u00fd mong con ki\u00eau sa, qu\u00fd ph\u00e1i, xinh \u0111\u1eb9p v\u00e0 gi\u00e0u sang.", "sex": 5}
{"first_name": "Di\u1ec7u Ng\u00e2n", "meaning": "Ng\u00e2n l\u00e0 t\u00ean c\u1ee7a con s\u00f4ng Ng\u00e2n h\u00e0. Di\u1ec7u l\u00e0 hi\u1ec1n di\u0323u, nh\u1eb9 nh\u00e0ng, di\u0323u d\u00e0ng. Di\u1ec7u Ng\u00e2n ngh\u0129a l\u00e0 con nh\u01b0 d\u00f2ng s\u00f4ng Ng\u00e2n h\u00e0 hi\u1ec1n di\u0323u, nh\u1eb9 nh\u00e0ng, \u0111\u1eb1m th\u1eafm.", "sex": 5}
{"first_name": "Du Ng\u00e2n", "meaning": "Ng\u00e2n l\u00e0 ti\u1ec1n c\u1ee7a. Du c\u00f3 ngh\u0129a l\u00e0 di \u0111\u1ed9ng, kh\u00f4ng c\u1ed1 \u0111\u1ecbnh, chu du \u0111\u00f3 \u0111\u00e2y. Du Ng\u00e2n ngh\u0129a l\u00e0 cha m\u1eb9 mong con c\u00f3 cu\u1ed9c s\u1ed1ng s\u00f4i \u0111\u1ed9ng, c\u00f3 th\u1ec3 ngao du kh\u00e1m ph\u00e1 th\u1ebf gi\u1edbi, l\u1eadp s\u1ef1 nghi\u1ec7p gi\u00e0u c\u00f3, s\u1ed1ng sung s\u01b0\u1edbng.", "sex": 5}
{"first_name": "Gia Ng\u00e2n", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 qu\u00fd b\u00e1u. \"Gia\" l\u00e0 nh\u00e0. \"Gia Ng\u00e2n\" - con ch\u00ednh l\u00e0 t\u00e0i s\u1ea3n c\u1ee7a c\u1ee7a ba m\u1eb9.", "sex": 5}
{"first_name": "Giang Ng\u00e2n", "meaning": "Giang Ng\u00e2n nh\u01b0 m\u1ed9t d\u00f2ng s\u00f4ng hi\u1ec1n h\u00f2a, k\u1ebft h\u1ee3p v\u1edbi", "sex": 7}
{"first_name": "Gi\u00e1ng Ng\u00e2n", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a,  c\u00f2n c\u00f3 ngh\u0129a l\u00e0 qu\u00fd b\u00e1u. \"Gi\u00e1ng\" ngh\u0129a l\u00e0 s\u1ef1 ban cho, gieo t\u1eeb tr\u00ean xu\u1ed1ng. \"Gi\u00e1ng Ng\u00e2n\" l\u00e0 b\u00e1u v\u1eadt c\u1ee7a cha m\u1eb9, mong con lu\u00f4n may m\u1eafn, gi\u00e0u c\u00f3, c\u1ee7a c\u1ea3i nh\u01b0 t\u1eeb tr\u00ean tr\u1eddi ban xu\u1ed1ng kh\u00f4ng \u0111\u00f3i ngh\u00e8o.", "sex": 5}
{"first_name": "Giao Ng\u00e2n", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 qu\u00fd b\u00e1u. Trong ti\u1ebfng H\u00e1n Vi\u1ec7t \"Giao\" l\u00e0 t\u00ean c\u1ee7a lo\u00e0i c\u1ecf giao, mong manh, b\u00ecnh d\u1ecb nh\u01b0ng m\u1ea1nh m\u1ebd, \u00fd ch\u00ed. V\u1edbi t\u00ean \"Giao Ng\u00e2n\" cha m\u1eb9 mong con lu\u00f4n m\u1ea1nh m\u1ebd, s\u1ed1ng v\u1eefng v\u00e0ng v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng \u0111\u1ea7y \u0111\u1ee7, kh\u00f4ng lo \u00e2u.", "sex": 5}
{"first_name": "H\u00e0 Ng\u00e2n", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 qu\u00fd b\u00e1u. \"H\u00e0\" l\u00e0 d\u00f2ng s\u00f4ng. \"H\u00e0 Ng\u00e2n\" ngh\u0129a l\u00e0 con s\u00f4ng v\u00e0ng, \u00fd n\u00f3i con s\u1ebd lu\u00f4n \u0111\u1ea7y \u1eafp ti\u1ec1n t\u00e0i v\u1eadt ch\u1ea5t.", "sex": 5}
{"first_name": "H\u1ea3i Ng\u00e2n", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a,  c\u00f2n c\u00f3 ngh\u0129a l\u00e0 qu\u00fd b\u00e1u. \"H\u1ea3i\" l\u00e0 bi\u1ec3n.  \"H\u1ea3i Ng\u00e2n\" ngh\u0129a l\u00e0 bi\u1ec3n v\u00e0ng, \u00fd n\u00f3i con lu\u00f4n gi\u00e0u c\u00f3 sung s\u01b0\u1edbng ti\u1ec1n v\u00e0ng \u0111\u1ea7y \u0111\u1ee7.", "sex": 5}
{"first_name": "H\u1ea1nh Ng\u00e2n", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 qu\u00fd b\u00e1u. \"H\u1ea1nh\" l\u00e0 \u0111i\u1ec1u t\u1ed1t l\u00e0nh may m\u1eafn, c\u00f2n \u0111\u01b0\u1ee3c hi\u1ec3u l\u00e0 \u0111\u1ee9c t\u00ednh t\u1ed1t c\u1ee7a con ng\u01b0\u1eddi. \"H\u1ea1nh Ng\u00e2n\" ngh\u0129a l\u00e0 cha m\u1eb9 mong con ngoan hi\u1ec1n, hi\u1ebfu th\u1ea3o, \u0111\u1ee9c h\u1ea1nh t\u1ed1t \u0111\u1eb9p v\u00e0 c\u00f3 t\u01b0\u01a1ng lai \u0111\u1ea7y \u0111\u1ee7 \u1ea5m no.", "sex": 5}
{"first_name": "Hi\u1ec1n Ng\u00e2n", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 qu\u00fd b\u00e1u. \"Hi\u1ec1n\" l\u00e0 hi\u1ec1n h\u00f2a ngoan ngo\u00e3n, hi\u1ec1n l\u00e0nh t\u1ed1t b\u1ee5ng ch\u1ec9 v\u1ec1 t\u00ednh c\u00e1ch con ng\u01b0\u1eddi. \"Hi\u1ec1n Ng\u00e2n\"  ng\u1ee5 \u00fd l\u00e0 cha m\u1eb9 mong con ngoan hi\u1ec1n, t\u1ed1t b\u1ee5ng, s\u1ebd c\u00f3 t\u01b0\u01a1ng lai gi\u00e0u c\u00f3.", "sex": 5}
{"first_name": "Ho\u00e0ng Ng\u00e2n", "meaning": "\"Ho\u00e0ng Ng\u00e2n l\u00e0 t\u00ean \u0111\u1eb9p d\u00e0nh \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i.\r\nHo\u00e0ng: C\u00f3 ngh\u0129a l\u00e0 \"\"V\u00e0ng\"\", ho\u1eb7c ch\u1ec9 d\u00f2ng d\u00f5i t\u00f4n qu\u00fd c\u1ee7a vua (ho\u00e0ng t\u1ed9c, ho\u00e0ng \u0111\u1ebf).\r\nNg\u00e2n: C\u00f3 ngh\u0129a l\u00e0 ti\u1ec1n.\r\nB\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean con l\u00e0 Ho\u00e0ng Ng\u00e2n \u0111\u1ec3 th\u1ec3 hi\u1ec7n con nh\u01b0 v\u1eadt b\u00e1u, l\u00e0 c\u1ee5c v\u00e0ng, c\u1ee5c b\u1ea1c c\u1ee7a m\u00ecnh. V\u00e0 ta c\u00f2n c\u00f3 th\u1ec3 hi\u1ec3u theo 1 ngh\u0129a kh\u00e1c l\u00e0 cha m\u1eb9 mong mu\u1ed1n m\u1ed9t t\u01b0\u01a1ng lai sang gi\u00e0u, sung t\u00fac d\u00e0nh cho con c\u1ee7a m\u00ecnh.\"", "sex": 5}
{"first_name": "H\u1ed3ng Ng\u00e2n", "meaning": "Th\u01b0\u1eddng l\u00e0 t\u00ean ri\u00eang \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con g\u00e1i \u1edf Vi\u1ec7t Nam. Theo ti\u1ebfng H\u00e1n, H\u1ed3ng ngh\u0129a l\u00e0 \u0111\u1ecf, l\u00e0 m\u00e0u s\u1eafc s\u00e1ng, r\u1ef1c r\u1ee1; Ng\u00e2n ngh\u0129a l\u00e0 ch\u00e2u b\u00e1u ho\u1eb7c v\u1eadt ch\u1ea5t c\u00f3 gi\u00e1 tr\u1ecb qu\u00fd b\u00e1u. H\u1ed3ng Ng\u00e2n c\u00f3 th\u1ec3 \u0111\u01b0\u1ee3c hi\u1ec3u l\u00e0 m\u1ed9t c\u00e1i t\u00ean \u0111\u01b0\u1ee3c g\u1eedi g\u1eafm \u00fd ngh\u0129a v\u1ec1 m\u1ed9t cu\u1ed9c s\u1ed1ng \u0111\u1ea7y \u0111\u1ee7 v\u1eadt ch\u1ea5t v\u00e0 t\u01b0\u01a1i s\u00e1ng.", "sex": 5}
{"first_name": "H\u01b0\u01a1ng Ng\u00e2n", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 qu\u00fd b\u00e1u. \"H\u01b0\u01a1ng\" l\u00e0 m\u00f9i th\u01a1m. \"H\u01b0\u01a1ng Ng\u00e2n\" ngh\u0129a l\u00e0 cha m\u1eb9 mong con lu\u00f4n gi\u00e0u c\u00f3 sung s\u01b0\u1edbng, c\u00f3 ti\u1ebfng th\u01a1m v\u1edbi \u0111\u1eddi.", "sex": 5}
{"first_name": "Huy Ng\u00e2n", "meaning": "\"Ng\u00e2n l\u00e0 ti\u1ec1n c\u1ee7a, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 qu\u00fd b\u00e1u. \"Huy\" l\u00e0 huy ho\u00e0ng, t\u01b0\u01a1ng lai gi\u00e0u c\u00f3. \"Huy Ng\u00e2n\" ngh\u0129a l\u00e0 cha m\u1eb9 mong cho con t\u01b0\u01a1ng lai gi\u00e0u c\u00f3 huy ho\u00e0ng.", "sex": 3}
{"first_name": "Huy\u1ec1n Ng\u00e2n", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 qu\u00fd b\u00e1u. \"Huy\u1ec1n\" l\u00e0 m\u1ed9t trong nh\u1eefng t\u1eeb v\u1edbi thanh s\u1eafc nh\u1eb9 nh\u00e0ng, m\u1ec1m m\u1ecfng th\u01b0\u1eddng \u0111\u01b0\u1ee3c d\u00f9ng l\u00e0m t\u00ean l\u00f3t cho con g\u00e1i. \u0110\u1eb7t t\u00ean con l\u00e0 \"Huy\u1ec1n Ng\u00e2n\" \u00fd mong con xinh \u0111\u1eb9p v\u00e0 gi\u00e0u c\u00f3.", "sex": 5}
{"first_name": "Hu\u1ef3nh Ng\u00e2n", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 qu\u00fd b\u00e1u. \"Hu\u1ef3nh\" khi \u0111\u1ecdc tr\u1ea1i \u0111i c\u00f3 ngh\u0129a l\u00e0 \"qu\u1ef3nh\", \u00fd n\u00f3i lo\u00e0i hoa ng\u00e1t h\u01b0\u01a1ng th\u01a1m. \"Hu\u1ef3nh Ng\u00e2n\" mang \u00fd ngh\u0129a con xinh \u0111\u1eb9p, t\u1ecfa h\u01b0\u01a1ng th\u01a1m nh\u01b0 hoa v\u00e0 c\u00f3 t\u01b0\u01a1ng lai gi\u00e0u c\u00f3 sung t\u00fac.", "sex": 5}
{"first_name": "Kha Ng\u00e2n", "meaning": "Ng\u00e2n l\u00e0 ti\u1ec1n c\u1ee7a. Kha th\u1ec3 hi\u1ec7n \u00fd ch\u00ed v\u00e0 tinh th\u1ea7n m\u1ea1nh m\u1ebd c\u1ee7a b\u1eadc nam nhi. Kha Ng\u00e2n ngh\u0129a l\u00e0 con m\u1ea1nh m\u1ebd, ti\u0301nh c\u00e1nh nam t\u1eed h\u00e1n & cu\u1ed9c s\u1ed1ng sang gi\u00e0u.", "sex": 7}
{"first_name": "Kh\u00e1 Ng\u00e2n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Ng\u00e2n\"c\u00f3 ngh\u0129a l\u00e0 ti\u1ec1n. Th\u1ec3 hi\u1ec7n s\u1ef1 qu\u00fd b\u00e1u. T\u00ean Ng\u00e2n mang \u00fd ngh\u0129a con l\u00e0 t\u00e0i s\u1ea3n qu\u00fd gi\u00e1 c\u1ee7a cha m\u1eb9 hay c\u00f2n c\u00f3 th\u1ec3 hi\u1ec3u l\u00e0 cha m\u1eb9 mong mu\u1ed1n t\u01b0\u01a1ng lai con lu\u00f4n \u0111\u01b0\u1ee3c \u0111\u1ee7 \u0111\u1ea7y, sung s\u01b0\u1edbng.\"Kh\u00e1\" th\u1ec3 hi\u1ec7n \u00fd ngh\u0129a mong mu\u1ed1n cu\u1ed9c s\u1ed1ng sung t\u00fac, \u0111\u1ee7 \u0111\u1ea7y, lu\u00f4n lu\u00f4n \u1ea5m no v\u00e0 h\u1ea1nh ph\u00fac.\"Ng\u00e2n Kh\u00e1\" con l\u00e0 t\u00e0i s\u1ea3n qu\u00fd gi\u00e1 nh\u1ea5t c\u1ee7a ba m\u1eb9, mong mu\u1ed1n t\u01b0\u01a1ng lai con g\u1eb7p nhi\u1ec1u \u0111i\u1ec1u may m\u1eafn,cu\u1ed9c s\u1ed1ng \u0111\u1ea7y \u0111\u1ee7 sung t\u00fac \u1ea5m no h\u1ea1nh ph\u00fac.", "sex": 5}
