{"first_name": "Qu\u1ef3nh Ng\u00e2n", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 qu\u00fd b\u00e1u. Theo ngh\u0129a g\u1ed1c H\u00e1n, \"Qu\u1ef3nh\" l\u00e0 m\u1ed9t vi\u00ean ng\u1ecdc \u0111\u1eb9p v\u00e0 thanh t\u00fa. Ngo\u00e0i ra \"Qu\u1ef3nh\" c\u00f2n l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa lu\u00f4n n\u1edf ng\u00e1t h\u01b0\u01a1ng v\u00e0o ban \u0111\u00eam, th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi thanh t\u00fa, dung m\u1ea1o xinh \u0111\u1eb9p, b\u1ea3n t\u00ednh khi\u00eam nh\u01b0\u1eddng, thanh cao. V\u1edbi t\u00ean \"Qu\u1ef3nh Ng\u00e2n\" , ba m\u1eb9 mong con xinh \u0111\u1eb9p, t\u00ednh t\u00ecnh hi\u1ec1n h\u00f2a, s\u1ed1ng khi\u00eam nh\u01b0\u1eddng, t\u01b0\u01a1ng lai \u0111\u1ea7y \u0111\u1ee7 no \u1ea5m.", "sex": 5}
