{"first_name": "B\u00e1c L\u00e2m", "meaning": "B\u00e1c l\u00e0 d\u1ed3i d\u00e0o ki\u1ebfn th\u1ee9c. B\u00e1c L\u00e2m l\u00e0 r\u1eebng ki\u1ebfn th\u1ee9c, ch\u1ec9 con ng\u01b0\u1eddi tr\u00ed tu\u1ec7, t\u00e0i ba.", "sex": 3}
{"first_name": "B\u0103ng L\u00e2m", "meaning": "B\u0103ng l\u00e0 tuy\u1ebft gi\u00e1. B\u0103ng L\u00e2m l\u00e0 r\u1eebng b\u0103ng, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi c\u1ee9ng r\u1eafn, t\u00e0i gi\u1ecfi.", "sex": 3}
{"first_name": "B\u1ea3o L\u00e2m", "meaning": "B\u1ea3o l\u00e0 qu\u00fd gi\u00e1. B\u1ea3o L\u00e2m l\u00e0 r\u1eebng qu\u00fd, ch\u1ec9 con ng\u01b0\u1eddi t\u00e0i n\u0103ng, gi\u00e1 tr\u1ecb.", "sex": 3}
{"first_name": "B\u00edch L\u00e2m", "meaning": "B\u00edch l\u00e0 b\u1ee9c t\u01b0\u1eddng. B\u00edch L\u00e2m l\u00e0 r\u1eebng d\u00e0y nh\u01b0 b\u1ee9c t\u01b0\u1eddng, ch\u1ec9 con ng\u01b0\u1eddi gi\u1ecfi giang, m\u1ea1nh m\u1ebd, th\u00e1i \u0111\u1ed9 ki\u00ean \u0111\u1ecbnh.", "sex": 3}
{"first_name": "B\u00ecnh L\u00e2m", "meaning": "B\u00ecnh l\u00e0 c\u00e2n b\u1eb1ng. B\u00ecnh L\u00e2m l\u00e0 c\u00e1nh r\u1eebng b\u00ecnh \u1ed5n, ch\u1ec9 th\u00e1i \u0111\u1ed9 ng\u01b0\u1eddi nghi\u00eam t\u00fac, \u0111\u01b0\u1eddng ho\u00e0ng.", "sex": 3}
{"first_name": "B\u1eedu L\u00e2m", "meaning": "B\u1eedu l\u00e0 t\u1eeb tr\u1ea1i c\u1ee7a B\u1ea3o, ngh\u0129a l\u00e0 c\u00e1nh r\u1eebng qu\u00fd gi\u00e1", "sex": 3}
{"first_name": "Cao L\u00e2m", "meaning": "Cao l\u00e0 \u1edf tr\u00ean. Cao L\u00e2m l\u00e0 r\u1eebng m\u1ecdc tr\u00ean cao, ch\u1ec9 th\u00e1i \u0111\u1ed9 cao qu\u00fd, nghi\u00eam t\u00fac.", "sex": 3}
{"first_name": "Ch\u00e2u L\u00e2m", "meaning": "\"Ch\u00e2u\" \u00fd ch\u1ec9 ch\u00e2u b\u00e1u, ng\u1ecdc ng\u00e0, qu\u00fd hi\u1ebfm. Ch\u00e2u L\u00e2m c\u00f3 \u00fd ngh\u0129a l\u00e0 m\u00f3n qu\u00e0 to l\u1edbn m\u00e0 ch\u00faa tr\u1eddi ban t\u1eb7ng, qu\u00fd gi\u00e1 nh\u1ea5t .", "sex": 3}
{"first_name": "Chi L\u00e2m", "meaning": "\"Chi\" nghi\u0303a la\u0300 ca\u0300nh, trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i. L\u00e2m ch\u1ec9 s\u1ef1 quy\u1ec1n l\u1ef1c, l\u1edbn m\u1ea1nh, v\u1ecb th\u1ebf. Chi L\u00e2m th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 \u0111\u1ecba v\u1ecb trong x\u00e3 h\u1ed9i, d\u00f2ng d\u00f5i ho\u00e0ng gia.", "sex": 3}
{"first_name": "C\u01b0\u1eddng L\u00e2m", "meaning": "C\u01b0\u1eddng l\u00e0 m\u1ea1nh m\u1ebd. C\u01b0\u1eddng L\u00e2m l\u00e0 c\u00e1nh r\u1eebng m\u1ecdc kh\u1ecfe, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi c\u00f3 kh\u00ed ch\u1ea5t h\u01a1n \u0111\u1eddi", "sex": 3}
{"first_name": "Danh L\u00e2m", "meaning": "\"Danh\" \u00fd ch\u1ec9 v\u1ec1 s\u1ef1 nghi\u1ec7p, l\u00e0 ng\u01b0\u1eddi t\u00e0i n\u0103ng s\u1ebd th\u00e0nh danh, \u0111\u1ed7 \u0111\u1ea1t. Danh L\u00e2m, \u00fd ch\u1ec9 ng\u01b0\u1eddi t\u00e0i ba, gi\u1ecfi giang trong c\u00f4ng vi\u1ec7c, n\u1eafm quy\u1ec1n trong t\u01b0\u01a1ng lai.", "sex": 3}
{"first_name": "Di L\u00e2m", "meaning": "\"Di\" ngh\u0129a l\u00e0 vui v\u1ebb, sung s\u01b0\u1edbng. Di L\u00e2m, mu\u1ed1n n\u00f3i m\u1ed9t ng\u01b0\u1eddi th\u00e0nh \u0111\u1ea1t, l\u1edbn m\u1ea1nh, cu\u1ed9c s\u1ed1ng vui v\u1ebb, v\u00f4 t\u01b0, v\u00f4 lo, tho\u1ea3i m\u00e1i", "sex": 3}
{"first_name": "D\u0129 L\u00e2m", "meaning": "\"D\u0129\" ng\u1ee5 \u00fd s\u1ef1 kh\u1edfi \u0111\u1ea7u, xu\u1ea5t ph\u00e1t \u0111i\u1ec3m. D\u0129 L\u00e2m, th\u1ec3 hi\u1ec7n m\u1ed9t con ng\u01b0\u1eddi c\u00f3 t\u00ednh t\u1ef1 l\u1eadp, m\u1ea1nh m\u1ebd, lu\u00f4n t\u00ecm t\u00f2i \u0111\u1ec3 \u0111i \u0111\u1ea7u trong s\u1ef1 nghi\u1ec7p, mang h\u01b0\u1edbng ti\u1ebfn b\u1ed9, ho\u00e0n thi\u1ec7n", "sex": 3}
{"first_name": "Di\u1ec7u L\u00e2m", "meaning": "\"Di\u1ec7u\" \u00fd n\u00f3i s\u1ef1 kh\u00e9o l\u00e9o, t\u00ednh c\u00e1ch \u0111\u1eb9p trong cu\u1ed9c s\u1ed1ng. Di\u1ec7u L\u00e2m, ch\u1ec9 m\u1ed9t ng\u01b0\u1eddi c\u00f3 l\u1ed1i s\u1ed1ng \u0111\u1eb9p, bi\u1ebft l\u00e0m ch\u1ee7 cu\u1ed9c s\u1ed1ng c\u1ee7a m\u00ecnh, c\u00e2n b\u1eb1ng \u0111\u01b0\u1ee3c nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p nh\u1ea5t", "sex": 7}
{"first_name": "\u0110inh L\u00e2m", "meaning": "\"\u0110inh\" l\u00e0 g\u1eafn k\u1ebft, bi\u1ec3u hi\u1ec7n s\u1ef1 an \u0111\u1ecbnh, v\u1eefng v\u00e0ng, m\u1ea1nh m\u1ebd. \u0110inh L\u00e2m, \u00fd ch\u1ec9 ng\u01b0\u1eddi c\u00f3 th\u1ec3 tin t\u01b0\u1edfng cao, ng\u01b0\u1eddi c\u00f3 t\u1ea7m nh\u00ecn xa, l\u00e0m n\u00ean vi\u1ec7c l\u1edbn, c\u00f3 quy\u1ec1n th\u1ebf trong c\u00f4ng vi\u1ec7c", "sex": 3}
{"first_name": "\u0110\u00ecnh L\u00e2m", "meaning": "\"\u0110\u00ecnh\" th\u1ec3 hi\u1ec7n s\u1ef1 m\u1ea1nh m\u1ebd, c\u1ee9ng r\u1eafn, v\u1eefng ch\u1eafc \u00fd ch\u00ed. \u0110\u00ecnh L\u00e2m, \u00fd n\u00f3i ng\u01b0\u1eddi c\u00f3 \u0111\u1ed9 tin c\u1eady cao, ch\u1eafc ch\u1eafn, c\u00f3 t\u00ednh ki\u00ean \u0111\u1ecbnh, c\u00f3 th\u1ec3 tin t\u01b0\u1edfng tuy\u1ec7t \u0111\u1ed1i", "sex": 3}
{"first_name": "Do L\u00e2m", "meaning": "\"Do\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 nguy\u00ean nh\u00e2n, kh\u1edfi \u0111\u1ea7u, ch\u1ed7 xu\u1ea5t ph\u00e1t, mang t\u00ednh tr\u00ed tu\u1ec7 s\u00e1ng t\u1ea1o. Do L\u00e2m, n\u00f3i \u0111\u1ebfn m\u1ed9t ng\u01b0\u1eddi t\u00e0i tr\u00ed v\u1eb9n to\u00e0n, mang h\u01b0\u1edbng ti\u1ebfn b\u1ed9, \u0111i \u0111\u1ea7u.", "sex": 3}
{"first_name": "\u0110\u00f4 L\u00e2m", "meaning": "\"\u0110\u00f4\" \u00fd ch\u1ec9 l\u00e0 m\u1ea1nh m\u1ebd, c\u1ee9ng c\u00e1p, h\u00f9ng d\u0169ng. \u0110\u00f4 L\u00e2m, l\u00e0 ng\u01b0\u1eddi lu\u00f4n \u0111i \u0111\u1ea7u, c\u00f3 nh\u1eefng s\u00e1ng ki\u1ebfn, s\u00e1ng t\u1ea1o hay trong cu\u1ed9c s\u1ed1ng, lu\u00f4n \u0111i \u0111\u1ea7u v\u00e0 ph\u00e1t tri\u1ec3n trong c\u00f4ng vi\u1ec7c.", "sex": 3}
{"first_name": "\u0110\u00f4ng L\u00e2m", "meaning": "\"\u0110\u00f4ng\" ch\u1ec9 ng\u01b0\u1eddi t\u1ec9nh t\u00e1o, th\u00e1i \u0111\u1ed9 b\u00ecnh t\u0129nh, s\u00e2u s\u1eafc, lu\u00f4n h\u01b0\u1edbng v\u1ec1 s\u1ef1 \u1ea5m \u00e1p. \u0110\u00f4ng L\u00e2m, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi bi\u1ebft ngh\u0129 s\u00e2u s\u1eafc, \u1ea5m \u00e1p, ng\u1ecdt ng\u00e0o, lu\u00f4n h\u01b0\u1edbng v\u1ec1 gia \u0111\u00ecnh, t\u1ea1o n\u00ean t\u1ed5 \u1ea5m h\u1ea1nh ph\u00fac.", "sex": 3}
{"first_name": "\u0110\u1ed3ng L\u00e2m", "meaning": "\"\u0110\u1ed3ng\" \u00fd n\u00f3i s\u1ef1 t\u01b0\u01a1i tr\u1ebb, nh\u1ecf nh\u1eafn, ng\u00e2y ng\u00f4. \u0110\u1ed3ng L\u00e2m, n\u00f3i v\u1ec1 t\u00ecnh y\u00eau th\u01b0\u01a1ng c\u1ee7a cha m\u1eb9 d\u00e0nh cho con c\u00e1i, con lu\u00f4n l\u00e0 th\u1ea7n \u0111\u1ed3ng c\u1ee7a ba m\u1eb9", "sex": 3}
{"first_name": "D\u01b0\u01a1ng L\u00e2m", "meaning": "\"D\u01b0\u01a1ng\" \u00fd ch\u1ec9 s\u1ef1 s\u00e1ng ng\u1eddi, t\u1ecfa s\u00e1ng. D\u01b0\u01a1ng L\u00e2m, c\u00f3 \u00fd ngh\u0129a mong con c\u00e1i sau n\u00e0y s\u1ebd th\u00e0nh c\u00f4ng, \u0111\u1ea1t \u0111\u1ec9nh cao c\u1ee7a ngh\u1ec1 nghi\u1ec7p, \u0111i \u0111\u1ea7u trong s\u1ef1 nghi\u1ec7p", "sex": 3}
{"first_name": "Duy L\u00e2m", "meaning": "\"Duy\" ch\u1ec9 s\u1ef1 t\u01b0 duy, ki\u1ebfn th\u1ee9c, suy ngh\u0129 th\u1ea5u \u0111\u00e1o. Duy L\u00e2m, mong mu\u1ed1n con sau n\u00e0y c\u00f3 \u00fd ngh\u0129 s\u00e2u s\u1eafc v\u1edbi m\u1ecdi \u0111i\u1ec1u xung quanh, l\u00e0 m\u1ed9t ng\u01b0\u1eddi tr\u1ee5 c\u1ed9t v\u1eefng m\u1ea1nh trong gia \u0111\u00ecnh, v\u00e0 ngo\u00e0i x\u00e3 h\u1ed9i", "sex": 3}
{"first_name": "H\u00e0 L\u00e2m", "meaning": "\"H\u00e0\" \u00fd ch\u1ec9 d\u00f2ng s\u00f4ng v\u1edbi t\u00ednh c\u00e1ch nh\u1eb9 nh\u00e0ng, hi\u1ec1n h\u00f2a. H\u00e0 L\u00e2m th\u1ec3 hi\u1ec7n m\u1ed9t ng\u01b0\u1eddi b\u00ean ngo\u00e0i c\u1ee9ng r\u1eafn, m\u1ea1nh m\u1ebb v\u1edbi m\u1ed9t t\u00e2m h\u1ed3n b\u00ean trong nh\u1eb9 nh\u00e0ng, thanh khi\u1ebft bi\u1ebft bao", "sex": 3}
{"first_name": "H\u1ea1 L\u00e2m", "meaning": "\"H\u1ea1\" ch\u1ec9 s\u1ef1 an nh\u00e0n, r\u1ea3nh r\u1ed7i, th\u01b0 th\u00e1i nh\u1eb9 nh\u00e0ng. H\u1ea1 L\u00e2m, n\u00f3i l\u00ean m\u1ed9t ng\u01b0\u1eddi c\u1ee9ng c\u1ecfi, c\u00f3 t\u00ednh c\u00e1ch tho\u1ea3i m\u00e1i, ph\u00f3ng tho\u00e1ng, suy ngh\u0129 theo h\u01b0\u1edbng t\u00edch c\u1ef1c, v\u00f4 t\u01b0.", "sex": 5}
{"first_name": "H\u1ea3i L\u00e2m", "meaning": "\"H\u1ea3i\" c\u00f3 ngh\u0129a l\u00e0 bi\u1ec3n, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. H\u1ea3i L\u00e2m, ng\u1ee5 \u00fd ch\u1ec9 m\u1ed9t ng\u01b0\u1eddi c\u00f3 t\u00ecnh c\u1ea3m bao la, s\u00e2u s\u1eafc, y\u00eau mu\u00f4n ng\u01b0\u1eddi, mu\u00f4n v\u1eadt, l\u1ed1i s\u1ed1ng mang h\u01b0\u1edbng t\u00ecnh c\u1ea3m, d\u1ea1t d\u00e0o.", "sex": 3}
{"first_name": "H\u00e0n L\u00e2m", "meaning": "\"H\u00e0n\" \u00fd ch\u1ec9 s\u1ef1 uy\u00ean b\u00e1c, gi\u1ecfi giang. H\u00e0n L\u00e2m c\u00f3 ngh\u0129a l\u00e0 ng\u01b0\u1eddi h\u1ed9i t\u1ee5 nh\u1eefng t\u01b0 ch\u1ea5t cao qu\u00fd, ki\u1ebfn th\u1ee9c uy\u00ean th\u00e2m, \u0111\u1ea1o \u0111\u1ee9c cao v\u1eddi, \u0111a t\u00e0i", "sex": 3}
{"first_name": "H\u1ea1nh L\u00e2m", "meaning": "\"H\u1ea1nh\" ch\u1ec9 \u0111\u1ea1o \u0111\u1ee9c, t\u00ednh n\u1ebft c\u1ee7a con ng\u01b0\u1eddi. H\u1ea1nh L\u00e2m ch\u1ec9 ng\u01b0\u1eddi \u0111a t\u00e0i, gi\u1ecfi giang, n\u1ebft na, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, \u0111\u00f4n h\u1eadu, ph\u1ea9m ch\u1ea5t cao \u0111\u1eb9p.", "sex": 5}
{"first_name": "Hi\u1ec3n L\u00e2m", "meaning": "\"Hi\u1ec3n\" c\u00f3 ngh\u0129a l\u00e0 v\u1ebb vang, th\u1ec3 hi\u1ec7n nh\u1eefng ng\u01b0\u1eddi c\u00f3 \u0111\u1ecba v\u1ecb trong x\u00e3 h\u1ed9i. Hi\u1ec3n L\u00e2m, \u00fd mu\u1ed1n n\u00f3i ng\u01b0\u1eddi bi\u1ebft nh\u00ecn xa tr\u00f4ng r\u1ed9ng, \u0111i \u0111\u1ea7u trong m\u1ecdi c\u00f4ng vi\u1ec7c, lu\u00f4n \u0111\u1ea1t nhi\u1ec1u th\u00e0nh c\u00f4ng trong cu\u1ed9c s\u1ed1ng", "sex": 3}
{"first_name": "Hi\u1ec3u L\u00e2m", "meaning": "\"Hi\u1ebfu\" th\u1ec3 hi\u1ec7n s\u1ef1 t\u00f4n k\u00ednh, qu\u00fd tr\u1ecdng, lu\u00f4n bi\u1ebft \u01a1n, ghi nh\u1edb nh\u1eefng b\u1eadc sinh th\u00e0nh. Hi\u1ebfu L\u00e2m, \u00fd ch\u1ec9 mong mu\u1ed1n con c\u00e1i sau n\u00e0y lu\u00f4n nh\u1edb \u0111\u1ebfn c\u00f4ng lao to l\u1edbn c\u1ee7a cha m\u1eb9, hi\u1ebfu th\u1ea3o v\u1edbi b\u1eadc sinh th\u00e0nh", "sex": 3}
{"first_name": "Hoa L\u00e2m", "meaning": "\"Hoa\" \u00fd ch\u1ec9 ph\u00e1i \u0111\u1eb9p, cu\u1ed9c s\u1ed1ng nhi\u1ec7m m\u00e0u. Hoa L\u00e2m, ng\u1ee5 \u00fd ba m\u1eb9 mong mu\u1ed1n cho con c\u1ee7a m\u00ecnh sau n\u00e0y s\u1ebd lu\u00f4n kh\u1ecfe m\u1ea1nh, xinh \u0111\u1eb9p, c\u00f3 m\u1ed9t cu\u1ed9c s\u1ed1ng \u1ea5m \u00eam.", "sex": 5}
{"first_name": "H\u00f2a L\u00e2m", "meaning": "\"H\u00f2a\" \u00fd n\u00f3i ng\u01b0\u1eddi c\u00f3 \u0111\u1ee9c t\u00ednh \u00f4n h\u00f2a, h\u00f2a nh\u00e3. H\u00f2a L\u00e2m, n\u00f3i \u0111\u1ebfn m\u1ed9t ng\u01b0\u1eddi gi\u1ecfi giang, \u0111a t\u00e0i, lu\u00f4n khi\u00eam nh\u01b0\u1eddng, h\u00f2a nh\u00e3 v\u1edbi m\u1ecdi ng\u01b0\u1eddi, bi\u1ebft v\u01b0\u01a1n xa trong s\u1ef1 nghi\u1ec7p.", "sex": 3}
{"first_name": "Ho\u00e0i L\u00e2m", "meaning": "\"Ho\u00e0i\" \u00fd ch\u1ec9 s\u1ef1 th\u01b0\u01a1ng nh\u1edb, nh\u1edb nhung. Ho\u00e0i L\u00e2m, \u00fd mu\u1ed1n n\u00f3i cha m\u1eb9 lu\u00f4n y\u00eau th\u01b0\u01a1ng con c\u00e1i v\u1edbi t\u00ecnh y\u00eau r\u1ed9ng l\u1edbn, bao la, v\u00f4 b\u1edd b\u1ebfn", "sex": 3}
{"first_name": "Ho\u00e0n L\u00e2m", "meaning": "\"Ho\u00e0n\" ch\u1ec9 s\u1ef1 t\u00ecm ki\u1ebfm, t\u00ecm l\u1ea1i nh\u1eefng \u0111i\u1ec1u \u0111\u00e3 qua, g\u1ee3i s\u1ef1 l\u01b0u luy\u1ebfn, nh\u1edb th\u01b0\u01a1ng. Ho\u00e0n L\u00e2m, \u00fd ch\u1ec9 m\u1ed9t ng\u01b0\u1eddi c\u00f3 suy ngh\u0129 s\u00e2u s\u1eafc, thi\u00ean v\u1ec1 t\u00ecnh c\u1ea3m gia \u0111\u00ecnh, d\u00f9 s\u1ef1 nghi\u1ec7p c\u00f3 l\u1edbn m\u1ea1nh nh\u01b0ng v\u1eabn lu\u00f4n nh\u1edb c\u1ed9i ngu\u1ed3n, g\u1ed1c g\u00e1c.", "sex": 3}
{"first_name": "Ho\u00e0ng L\u00e2m", "meaning": "\"Ho\u00e0ng\" ch\u1ec9 s\u1ef1 sang tr\u1ecdng, qu\u00fd ph\u00e1i. L\u00e2m th\u1ec3 hi\u1ec7n s\u1ef1 l\u1edbn m\u1ea1nh. Ho\u00e0ng L\u00e2m h\u01b0\u1edbng \u0111\u1ebfn ng\u01b0\u1eddi c\u00f3 t\u1ea7m nh\u00ecn r\u1ed9ng, lu\u00f4n c\u00f3 nh\u1eefng \u00fd ngh\u0129 l\u1edbn lao, v\u0129 \u0111\u1ea1i", "sex": 3}
{"first_name": "Hu\u1ec7 L\u00e2m", "meaning": "\"Hu\u1ec7\" ch\u1ec9 m\u1ed9t lo\u00e0i hoa, mang m\u00f9i h\u01b0\u01a1ng d\u1ecbu nh\u1eb9. Hu\u1ec7 L\u00e2m n\u00f3i l\u00ean m\u1ed9t ng\u01b0\u1eddi lu\u00f4n bi\u1ebft l\u1eafng nghe, c\u1ea3m nh\u1eadn s\u00e2u s\u1eafc, y\u00eau c\u00e1i \u0111\u1eb9p", "sex": 5}
{"first_name": "H\u01b0\u01a1ng L\u00e2m", "meaning": "\"H\u01b0\u01a1ng\" th\u1ec3 hi\u1ec7n \u0111\u01b0\u1ee3c s\u1ef1 d\u1ecbu d\u00e0ng, quy\u1ebfn r\u0169, thanh cao. H\u01b0\u01a1ng L\u00e2m, ch\u1ec9 s\u1ef1 kh\u1ecfe kho\u1eafn, \u0111\u1eb1m th\u1eafm c\u1ee7a m\u1ed9t ng\u01b0\u1eddi con g\u00e1i, m\u1ed9t v\u1ebb \u0111\u1eb9p s\u0103n ch\u1eafc, nh\u1eb9 nh\u00e0ng m\u00e0 h\u1ea5p d\u1eabn", "sex": 5}
{"first_name": "Kh\u1ea3 L\u00e2m", "meaning": "\"Kh\u1ea3\" \u00fd ch\u1ec9 l\u00e0 c\u00f3 th\u1ec3, l\u00e0m \u0111\u01b0\u1ee3c, l\u00e0m t\u1ed1t. Kh\u1ea3 L\u00e2m, \u00fd n\u00f3i cha m\u1eb9 mong mu\u1ed1n con lu\u00f4n c\u00f3 th\u1ec3 l\u00e0m \u0111\u01b0\u1ee3c m\u1ecdi vi\u1ec7c, gi\u1ecfi giang, t\u00e0i n\u0103ng, \u0111\u1ea1t \u0111\u01b0\u1ee3c th\u00e0nh c\u00f4ng trong cu\u1ed9c s\u1ed1ng, th\u1ec3 hi\u1ec7n m\u1ed9t ng\u01b0\u1eddi t\u1ef1 l\u1ef1c t\u1ef1 c\u01b0\u1eddng, s\u00e1ng d\u1ea1.", "sex": 5}
{"first_name": "Kh\u1ea3i L\u00e2m", "meaning": "\"Kh\u1ea3i\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi vui v\u1ebb, ho\u1ea1t b\u00e1t, n\u0103ng \u0111\u1ed9ng. Kh\u1ea3i L\u00e2m, ch\u1ec9 m\u1ed9t con ng\u01b0\u1eddi nh\u00e3 nh\u1eb7n, h\u00f2a \u0111\u1ed3ng, nhu c\u01b0\u01a1ng r\u00f5 r\u00e0ng, r\u1ea5t nh\u1ea1y b\u00e9n trong c\u00f4ng vi\u1ec7c sau n\u00e0y", "sex": 3}
{"first_name": "Kh\u00e1nh L\u00e2m", "meaning": "\"Kh\u00e1nh\" ngh\u0129a mu\u1ed1n n\u00f3i l\u00ean s\u1ef1 vui v\u1ebb, h\u00e2n hoan, th\u00e0nh \u0111\u1ea1t. Kh\u00e1nh L\u00e2m, \u00fd n\u00f3i ng\u01b0\u1eddi c\u00f3 \u0111\u1ee9c h\u1ea1nh t\u1ed1t, lu\u00f4n mang l\u1ea1i s\u1ef1 vui v\u1ebb, tho\u1ea3i m\u00e1i, h\u00e2n hoan cho m\u1ecdi ng\u01b0\u1eddi xung quanh", "sex": 3}
{"first_name": "Khi\u1ebfu L\u00e2m", "meaning": "\"Khi\u1ebfu\" ch\u1ec9 ng\u01b0\u1eddi c\u00f3 t\u00e0i, th\u00f4ng minh, s\u00e1ng d\u1ea1. Khi\u1ebfu L\u00e2m, mu\u1ed1n n\u00f3i m\u1ed9t ng\u01b0\u1eddi c\u00f3 \u00f3c s\u00e1ng t\u1ea1o, tr\u00ed l\u1ef1c, l\u00e0m vi\u1ec7c t\u1ed1t, bi\u1ebft ph\u00e1t huy c\u00e1c th\u1ebf m\u1ea1nh, lu\u00f4n \u0111i \u0111\u1ea7u trong s\u1ef1 nghi\u1ec7p, l\u00e0 m\u1ed9t ng\u01b0\u1eddi t\u00e0i cao, h\u1ecdc r\u1ed9ng.", "sex": 3}
{"first_name": "Khoa L\u00e2m", "meaning": "\"Khoa\" \u00fd n\u00f3i s\u1ef1 t\u00e0i gi\u1ecfi trong h\u1ecdc v\u1ea5n, suy ngh\u0129 c\u00f3 t\u00ednh tri\u1ebft l\u00fd, khoa h\u1ecdc. Khoa L\u00e2m, th\u1ec3 hi\u1ec7n m\u1ed9t ng\u01b0\u1eddi c\u00f3 t\u00e0i n\u0103ng thi\u00ean b\u1ea9m, gi\u1ecfi giang, s\u1edbm th\u00e0nh danh trong t\u01b0\u01a1ng l\u1ea1i", "sex": 3}
{"first_name": "Kh\u00f4i L\u00e2m", "meaning": "\"Kh\u00f4i\" ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi xinh \u0111\u1eb9p, v\u1ebb ngo\u00e0i tu\u1ea5n t\u00fa, ph\u1ea9m ch\u1ea5t th\u00f4ng minh, s\u00e1ng d\u1ea1. Kh\u00f4i L\u00e2m, \u00fd n\u00f3i t\u00e0i s\u1eafc v\u1eb9n to\u00e0n, h\u1ed9i t\u1ee5 \u0111\u1ea7y \u0111\u1ee7 nh\u1eefng ph\u1ea9m ch\u1ea5t t\u1ed1t, s\u1ebd th\u00e0nh danh v\u00e0 ti\u1ebfn xa h\u01a1n trong l\u01b0\u01a1ng lai.", "sex": 3}
{"first_name": "Ki\u1ec1u L\u00e2m", "meaning": "\"Ki\u1ec1u\" \u00fd n\u00f3i l\u00ean v\u1ebb \u0111\u1eb9p m\u1ea3nh mai, xinh \u0111\u1eb9p, cu\u1ed1n h\u00fat c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \"Ki\u1ec1u L\u00e2m\", \u00fd ch\u1ec9 n\u00e9t thu\u1ea7n th\u00fay, nhu m\u00ec c\u1ee7a ng\u01b0\u1eddi ph\u1ee5 n\u1eef \u0111\u1eb9p, t\u00e0i s\u1eafc v\u1eb9n to\u00e0n, cha m\u1eb9 lu\u00f4n mu\u1ed1n nh\u1eefng g\u00ec t\u1ed1t l\u00e0nh, \u0111\u1eb9p nh\u1ea5t cho con m\u00ecnh.", "sex": 5}
{"first_name": "Kim L\u00e2m", "meaning": "\"Kim\" ngh\u0129a l\u00e0 qu\u00fd b\u00e1u, gi\u00e1 tr\u1ecb, \u0111\u1ec7 nh\u1ea5t. Kim Ng\u00e2n, \u00fd ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i kh\u00f4ng nh\u1eefng \u0111\u1eb9p m\u00e0 c\u00f2n th\u00f4ng minh, tinh t\u1ebf, qu\u00fd gi\u00e1 \u0111\u00e1ng t\u1ef1a ng\u00e0n v\u00e0ng c\u1ee7a b\u1ed1 m\u1eb9.", "sex": 5}
{"first_name": "Lan L\u00e2m", "meaning": "\"Lan\" l\u00e0 m\u1ed9t lo\u00e0i hoa c\u00f3 m\u00f9i h\u01b0\u01a1ng nh\u1eb9, xinh \u0111\u1eb9p, thanh khi\u1ebft. Lan L\u00e2m, \u00fd ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i thu\u1ea7n khi\u1ebft, t\u00ednh t\u00ecnh d\u1ecbu d\u00e0ng, t\u00e2m h\u1ed3n \u0111\u1eb9p \u0111\u1ebd, lu\u00f4n c\u00f3 \u00fd ch\u00ed v\u01b0\u01a1n cao v\u01b0\u01a1n xa", "sex": 5}
{"first_name": "L\u1ec7 L\u00e2m", "meaning": "\"L\u1ec7\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi s\u1ed1ng n\u1ec1 n\u1ebfp, c\u00f3 th\u00f3i quen t\u1ed1t h\u1eb1ng ng\u00e0y. L\u1ec7 L\u00e2m, n\u00f3i l\u00ean t\u00ednh c\u00e1ch c\u1ee7a ng\u01b0\u1eddi con g\u00e1i \u0111i\u1ec1m \u0111\u1ea1m, gi\u1ea3n d\u1ecb, n\u1ebft na th\u00f9y m\u1ecb", "sex": 3}
{"first_name": "Li\u1ec5u L\u00e2m", "meaning": "\"Li\u1ec5u\" \u00fd ngh\u0129a h\u00ecnh \u1ea3nh ng\u01b0\u1eddi con g\u00e1i, mong manh, m\u1ec1m m\u1ea1i. Li\u1ec5u L\u00e2m, ng\u1ee5 \u00fd cha m\u1eb9 mong mu\u1ed1n con c\u00e1i s\u1ebd l\u00e0 ng\u01b0\u1eddi con g\u00e1i hi\u1ec1n th\u1ee5c, v\u00f3c d\u00e1ng thanh m\u1ea3nh, \u0111\u00e1ng y\u00eau, c\u00f3 l\u1ed1i s\u1ed1ng t\u1ef1 l\u1ef1c t\u1ef1 c\u01b0\u1eddng, \u0111\u1ed9c l\u1eadp, bi\u1ebft v\u01b0\u01a1n cao v\u01b0\u01a1n xa", "sex": 5}
{"first_name": "Anh Lan", "meaning": "\"Lan\" l\u00e0 t\u00ean 1 lo\u00e0i hoa, \"Anh\" l\u00e0 s\u1ef1 tinh anh, th\u00f4ng minh. V\u1edbi t\u00ean \"Anh Lan\" cha m\u1eb9 mong mu\u1ed1n con g\u00e1i s\u1ebd v\u1eeba xinh \u0111\u1eb9p nh\u01b0 m\u1ed9t \u0111\u00f3a hoa v\u1eeba gi\u1ecfi giang, th\u00f4ng minh.", "sex": 5}
{"first_name": "\u00c1nh Lan", "meaning": "\u00c1nh trong ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 \u00e1nh s\u00e1ng th\u1ec3 hi\u1ec7n s\u1ef1 soi r\u1ecdi, chi\u1ebfu s\u00e1ng v\u1ec1 1 t\u01b0\u01a1ng lai huy ho\u00e0ng \"Lan\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa qu\u00fd. \u00c1nh Lan c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 xinh \u0111\u1eb9p ph\u1ea3n chi\u1ebfu \u00e1nh s\u00e1ng c\u1ee7a lo\u00e0i hoa lan, t\u00ean th\u1ec3 hi\u1ec7n con g\u00e1i xinh \u0111\u1eb9p, th\u00f4ng minh, chi\u1ebfu s\u00e1ng v\u1edbi t\u00e2m t\u00ednh thanh cao nh\u01b0 lo\u00e0i hoa qu\u00fd", "sex": 5}
{"first_name": "B\u1ea1ch Lan", "meaning": "\"B\u1ea1ch Lan\" c\u00f3 ngh\u0129a l\u00e0 hoa lan tr\u1eafng, d\u00f9ng \u0111\u1ec3 mi\u00eau t\u1ea3 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, tinh t\u1ebf nh\u01b0 hoa lan, v\u1edbi t\u00e2m h\u1ed3n trong s\u00e1ng, th\u1eb3ng ngay. V\u1edbi t\u00ean \"B\u1ea1ch Lan\" cha m\u1eb9 mong con l\u1edbn l\u00ean xinh \u0111\u1eb9p c\u1ea3 v\u1ec1 di\u1ec7n m\u1ea1o l\u1eabn t\u00ednh t\u00ecnh, lu\u00f4n s\u1ed1ng thanh b\u1ea1ch \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau qu\u00fd, k\u00ednh tr\u1ecdng.", "sex": 5}
{"first_name": "B\u1ea3o Lan", "meaning": "\"B\u1ea3o Lan\" mang \u00fd ngh\u0129a con kh\u00f4ng ch\u1ec9 xinh \u0111\u1eb9p, ngo\u1ea1i h\u00ecnh duy\u00ean d\u00e1ng, thu h\u00fat m\u00e0 c\u00f2n c\u00f3 ph\u1ea9m ch\u1ea5t thanh cao, qu\u00fd gi\u00e1 nh\u01b0 b\u1ea3o v\u1eadt.", "sex": 5}
{"first_name": "B\u00edch Lan", "meaning": "Lan l\u00e0 hoa lan thanh cao xinh \u0111\u1eb9p. B\u00edch l\u00e0 t\u00ean 1 lo\u00e0i ng\u1ecdc \u0111\u1eb9p, qu\u00fd gi\u00e1. B\u00edch Lan c\u00f3 ngh\u0129a cha m\u1eb9 mong con xinh \u0111\u1eb9p, thanh cao v\u00e0 g\u1eb7p may m\u1eafn", "sex": 5}
{"first_name": "C\u1ea9m Lan", "meaning": "Lan l\u00e0 hoa lan thanh cao xinh \u0111\u1eb9p. C\u1ea9m c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m, t\u01b0\u01a1i \u0111\u1eb9p, l\u1ed9ng l\u1eaby. C\u1ea9m Lan l\u00e0 con xinh \u0111\u1eb9p l\u1ed9ng l\u1eaby, nh\u01b0ng ph\u1ea9m ch\u1ea5t thanh tao", "sex": 5}
{"first_name": "Chi Lan", "meaning": "\u0110\u00e2y l\u00e0 m\u1ed9t lo\u1ea1i c\u00e2y c\u1ecf thu\u1ed9c lo\u00e0i c\u1ecf c\u00e1t t\u01b0\u1eddng, h\u1ecd c\u00e2y b\u00e1ch h\u1ee3p. L\u00e0 lo\u00e0i th\u00e2n c\u1ecf s\u1ed1ng l\u00e2u n\u0103m, c\u00f3 m\u00e0u xanh quanh n\u0103m, r\u1ec5 c\u00f3 d\u1ea1ng c\u1ee7 m\u00e0u tr\u1eafng. T\u00ean \"Chi Lan\" th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 \u0111\u0103t cho con g\u00e1i v\u1edbi \u00fd ngh\u0129a con s\u1ebd kh\u1ecfe m\u1ea1nh v\u00e0 xinh \u0111\u1eb9p.", "sex": 5}
{"first_name": "C\u00f4ng Lan", "meaning": "C\u00f4ng l\u00e0 c\u00f4ng b\u1eb1ng ch\u00ednh tr\u1ef1c, Lan l\u00e0 t\u00ean lo\u00e0i hoa \u0111\u1eb9p. C\u00f4ng Lan c\u00f3 ngh\u0129a con v\u1eeba xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau v\u1eeba c\u00f3 t\u00ednh t\u00ecnh ch\u00ednh tr\u1ef1c c\u00f4ng b\u1eb1ng, v\u1edbi t\u00ean n\u00e0y \u00fd ngh\u0129a con xinh \u0111\u1eb9p c\u1ea3 ngo\u00e0i l\u1eabn trong", "sex": 5}
{"first_name": "D\u00e3 Lan", "meaning": "D\u00e3 trong ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ed3ng n\u1ed9i, m\u1ed9c m\u1ea1c c\u00f2n Lan l\u00e0 t\u00ean 1 lo\u00e0i hoa xinh \u0111\u1eb9p, thanh cao. D\u00e3 Lan mang \u00fd ngh\u0129a con l\u00e0 b\u00f4ng hoa xinh \u0111\u1eb9p v\u1edbi t\u00e2m h\u1ed3n m\u1ed9c m\u1ea1c, b\u00ecnh d\u1ecb,  thanh cao", "sex": 5}
{"first_name": "D\u1ea1 Lan", "meaning": "Lan l\u00e0 hoa lan thanh cao xinh \u0111\u1eb9p. D\u1ea1 theo ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 \u0111\u00eam t\u1ed1i. D\u1ea1 Lan c\u00f3 ngh\u0129a cha m\u1eb9 mong con xinh \u0111\u1eb9p, khi\u00eam t\u1ed1n hi\u1ec1n h\u00f2a nh\u01b0 hoa lan xinh \u0111\u1eb9p trong \u0111\u00eam.", "sex": 5}
{"first_name": "Di\u1ec7u Lan", "meaning": "Lan l\u00e0 hoa lan thanh cao xinh \u0111\u1eb9p. Di\u1ec7u l\u00e0 di\u1ec7u d\u00e0ng, th\u01b0\u1edbt tha. Di\u1ec7u Lan c\u00f3 ngh\u0129a cha m\u1eb9 mong con c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u00ednh t\u00ecnh di\u1ec7u d\u00e0ng, n\u1ebft na.", "sex": 5}
{"first_name": "H\u00e0 Lan", "meaning": "Lan l\u00e0 hoa lan thanh cao xinh \u0111\u1eb9p. H\u00e0 c\u00f3 ngh\u0129a l\u00e0 s\u00f4ng. H\u00e0 Lan c\u00f3 ngh\u0129a cha m\u1eb9 mong con c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, hi\u1ec1n h\u00f2a, nh\u1eb9 nh\u00e0ng nh\u01b0 hoa lan e \u1ea5p n\u1edf b\u00ean d\u00f2ng s\u00f4ng. Ngo\u00e0i ra H\u00e0 Lan c\u00f2n l\u00e0 t\u00ean 1 \u0111\u1ea5t n\u01b0\u1edbc xinh \u0111\u1eb9p n\u1ed5i ti\u1ebfng v\u1edbi c\u00e1c lo\u00e0i hoa, \u0111\u00e2y c\u00f3 th\u1ec3 l\u00e0 n\u01a1i \u0111\u00e1nh d\u1ea5u 1 k\u1ec9 ni\u1ec7m \u0111\u1eb9p c\u1ee7a cha m\u1eb9 ho\u1eb7c \u0111i\u1ec3m \u0111\u1ebfn y\u00eau th\u00edch c\u1ee7a cha m\u1eb9", "sex": 5}
{"first_name": "Ho\u00e0ng Lan", "meaning": "\"Ho\u00e0ng Lan\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa c\u00f3 ngu\u1ed3n g\u1ed1c t\u1eeb ti\u1ebfng Tagalog ilang-ilang, c\u00f3 ngh\u0129a l\u00e0 \"hoa c\u1ee7a c\u00e1c lo\u00e0i hoa\". T\u00ean \"Ho\u00e0ng Lan\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi con g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p h\u01a1n ng\u01b0\u1eddi, ph\u1ea9m ch\u1ea5t thanh cao, phong th\u00e1i uy quy\u1ec1n. Ng\u1ee5 \u00fd trong t\u00ean \"Ho\u00e0ng Lan\" c\u00f2n l\u00e0 s\u1ef1 mong m\u1ecfi m\u1ed9t cu\u1ed9c s\u1ed1ng sung t\u00fac, s\u00e1ng s\u1ee7a d\u00e0nh cho con.", "sex": 5}
