{"first_name": "H\u01b0\u01a1ng Lan", "meaning": "C\u00f3 ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m c\u1ee7a hoa lan, m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p c\u00f3 h\u01b0\u01a1ng th\u01a1m nh\u1eb9 nh\u00e0ng, quy\u1ebfn r\u0169, th\u01b0\u1eddng hay m\u1ecdc nhi\u1ec1u \u1edf c\u00e1c v\u00e1ch n\u00fai cao trong r\u1eebng. \"H\u01b0\u01a1ng Lan\" khi \u0111\u01b0\u1ee3c \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i s\u1ebd c\u00f3 \u00fd ngh\u0129a l\u00e0 \"nh\u1eb9 nh\u00e0ng, d\u1ecbu d\u00e0ng, \u0111\u1ea7y n\u1eef t\u00ednh v\u00e0 \u0111\u00e1ng y\u00eau\".", "sex": 5}
{"first_name": "Khu\u00ea Lan", "meaning": "\"Khu\u00ea\" l\u00e0 v\u00ec sao xinh \u0111\u1eb9p tr\u00ean b\u1ea7u tr\u1eddi, l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng cho s\u1ef1 th\u00f4ng minh, h\u1ecdc v\u1ea5n. \"Lan\" l\u00e0 lo\u00e0i hoa t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 thanh cao. \"Khu\u00ea Lan\" l\u00e0 mong mu\u1ed1n con xinh \u0111\u1eb9p, th\u00f4ng minh t\u1ecfa s\u00e1ng nh\u01b0 sao khu\u00ea, t\u00e2m t\u00ednh thanh cao, nh\u1eb9 nh\u00e0ng.", "sex": 5}
