{"first_name": "My Lan", "meaning": "\"My\" trong ti\u1ebfng H\u00e1n- Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p,  \u0111\u00e1ng y\u00eau. \"Lan\" l\u00e0 t\u00ean lo\u00e0i hoa thanh cao, tinh t\u1ebf. T\u00ean \"My Lan\" mang \u00fd ngh\u0129a mong mu\u1ed1n con xinh \u0111\u1eb9p nh\u01b0 hoa lan thanh cao, tinh t\u1ebf.", "sex": 5}
{"first_name": "M\u1ef9 Lan", "meaning": "M\u1ef9 trong ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p, t\u1ed1t l\u00e0nh \u0111\u1ec3 ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi con g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p nh\u01b0 hoa. Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Lan\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa qu\u00fd, c\u00f3 h\u01b0\u01a1ng th\u01a1m & s\u1eafc \u0111\u1eb9p. K\u1ebft h\u1ee3p c\u1ea3 2 t\u1eeb \u0111\u1ec3 ch\u1ec9 n\u00e9t \u0111\u1eb9p c\u1ee7a ng\u01b0\u1eddi con g\u00e1i, \u0111\u1eb7t t\u00ean n\u00e0y cha m\u1eb9 mong con l\u1edbn l\u00ean xinh \u0111\u1eb9p, thanh cao, tinh t\u1ebf \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau m\u1ebfn", "sex": 5}
