{"first_name": "Nhi Lan", "meaning": "\"Nhi Lan\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u00f3a hoa lan xinh \u0111\u1eb9p, b\u00e9 nh\u1ecf. T\u00ean n\u00e0y \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho b\u00e9 g\u00e1i v\u1edbi \u00fd ngh\u0129a con l\u00e0 thi\u00ean th\u1ea7n b\u00e9 nh\u1ecf xinh \u0111\u1eb9p c\u1ee7a cha m\u1eb9, mong \u01b0\u1edbc sau n\u00e0y con l\u1edbn s\u1ebd xinh \u0111\u1eb9p, e \u1ea5p v\u00e0 d\u1ecbu d\u00e0ng nh\u01b0 \u0111\u00f3a hoa lan.", "sex": 5}
