{"first_name": "Phong Lan", "meaning": "Phong Lan l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a s\u1ef1 gi\u00e0u c\u00f3, tinh t\u1ebf, t\u00ecnh y\u00eau,v\u00e0 v\u1ebb \u0111\u1eb9p. V\u1edbi t\u00ean Phong Lan, cha m\u1eb9 mong con g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, thanh l\u1ecbch, d\u00f9 xu\u1ea5t hi\u1ec7n \u1edf b\u1ea5t c\u1ee9 n\u01a1i \u0111\u00e2u c\u0169ng duy\u00ean d\u00e1ng & thu h\u00fat ngay l\u1eadp t\u1ee9c b\u1edfi c\u1ea3m gi\u00e1c tinh t\u1ebf & trong s\u00e1ng.", "sex": 5}
