{"first_name": "\u00c1nh Lam", "meaning": "\u00c1nh trong ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 \u00e1nh s\u00e1ng th\u1ec3 hi\u1ec7n s\u1ef1 soi r\u1ecdi, chi\u1ebfu s\u00e1ng v\u1ec1 1 t\u01b0\u01a1ng lai huy ho\u00e0ng. \"Lam\" l\u00e0 t\u00ean g\u1ecdi c\u1ee7a m\u1ed9t lo\u1ea1i ng\u1ecdc. \u00c1nh Lam mang \u00fd ngh\u0129a l\u00e0 s\u1ef1 chi\u1ebfu s\u00e1ng c\u1ee7a ng\u1ecdc lam, mang \u00fd ngh\u0129a m\u1ed9t t\u01b0\u01a1ng lai may m\u1eafn, t\u1ed1t \u0111\u1eb9p & mong mu\u1ed1n con c\u00f3 1 v\u1ebb ngo\u00e0i xinh \u0111\u1eb9p, s\u00e1ng s\u1ee7a, th\u1ec3 hi\u1ec7n s\u1ef1 tinh anh", "sex": 5}
{"first_name": "B\u1ea3o Lam", "meaning": "B\u1ea3o l\u00e0 c\u1ee7a qu\u00fd, Lam l\u00e0 ng\u1ecdc. B\u1ea3o Lam c\u00f3 ngh\u0129a l\u00e0 con qu\u00fd gi\u00e1 nh\u01b0 vi\u00ean ng\u1ecdc qu\u00fd & mang \u0111\u1ebfn may m\u1eafn cho m\u1ecdi ng\u01b0\u1eddi", "sex": 5}
{"first_name": "B\u00edch Lam", "meaning": "\"B\u00edch\" & \"Lam\" \u0111\u1ec1u l\u00e0 t\u00ean g\u1ecdi c\u1ee7a nh\u1eefng lo\u00e0i ng\u1ecdc qu\u00fd. T\u00ean \"B\u00edch Lam\", v\u1edbi ch\u1eef \"B\u00edch\" th\u1ec3 hi\u1ec7n t\u00ednh c\u00e1ch cao qu\u00fd, thanh tao, l\u00e0 ng\u01b0\u1eddi t\u00e0i n\u0103ng, c\u00e0ng m\u00e0i d\u0169a c\u00e0ng r\u00e8n luy\u1ec7n s\u1ebd c\u00e0ng t\u1ecfa s\u00e1ng, v\u00e0 ch\u1eef \"Lam\" th\u1ec3 hi\u1ec7n dung m\u1ea1o xinh \u0111\u1eb9p, s\u00e1ng ng\u1eddi. T\u00ean \"B\u00edch Lam\" h\u1ed9i \u0111\u1ee7 nh\u1eefng mong mu\u1ed1n t\u1ed1t \u0111\u1eb9p t\u1eeb t\u00e2m t\u00ednh \u0111\u1ebfn ngo\u1ea1i h\u00ecnh m\u00e0 cha m\u1eb9 d\u00e0nh cho con.", "sex": 5}
{"first_name": "Giang Lam", "meaning": "\"Giang\" c\u00f3 ngh\u0129a l\u00e0 s\u00f4ng , \"Lam\" l\u00e0 m\u00e0u xanh may m\u1eafn. \"Giang Lam\" mang \u00fd ngh\u0129a con nh\u01b0 d\u00f2ng s\u00f4ng xanh, xinh \u0111\u1eb9p, th\u01a1 m\u1ed9ng v\u00e0 lu\u00f4n g\u1eb7p may m\u1eafn", "sex": 5}
{"first_name": "Hi\u1ec3u Lam", "meaning": "\"Lam\" l\u00e0 ng\u1ecdc & \"Hi\u1ec3u\" l\u00e0 am t\u01b0\u1eddng, th\u00f4ng th\u00e1i. T\u00ean \"Hi\u1ec3u Lam\" nh\u1eb1m \u0111\u1ec3 ch\u1ec9 con l\u00e0 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, c\u1ed1t c\u00e1ch cao sang, t\u00e2m h\u1ed3n trong s\u00e1ng v\u00e0 b\u1ea3n t\u00ednh th\u00f4ng minh, hi\u1ec3u bi\u1ebft, s\u1ed1ng c\u00f3 l\u00fd l\u1ebd", "sex": 5}
