{"first_name": "Ki\u1ec1u Lam", "meaning": "Theo ti\u1ebfng H\u00e1n, t\u00ean \"Ki\u1ec1u\" mang \u00fd ngh\u0129a l\u00e0 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p \"Lam\" l\u00e0 t\u00ean g\u1ecdi c\u1ee7a m\u1ed9t lo\u1ea1i ng\u1ecdc. Ki\u1ec1u Lam c\u00f3 ngh\u0129a con g\u00e1i xinh \u0111\u1eb9p nh\u01b0 lo\u00e0i ng\u1ecdc & mang \u0111\u1ebf may m\u1eafn t\u1ed1t l\u00e0nh cho m\u1ecdi ng\u01b0\u1eddi", "sex": 5}
{"first_name": "M\u1ef9 Lam", "meaning": "M\u1ef9 trong ti\u1ebfng H\u00e1n l\u00e0 xinh \u0111\u1eb9p, m\u1ef9 mi\u1ec1u, Lam l\u00e0 ng\u1ecdc Lam may m\u1eafn. M\u1ef9 Lam ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, dung m\u1ea1o m\u1ef9 mi\u1ec1u, t\u1ecfa s\u00e1ng nh\u01b0 ng\u1ecdc & lu\u00f4n c\u00f3 v\u1eadn may", "sex": 5}
{"first_name": "Ng\u1ecdc Lam", "meaning": "T\u00ean \"Ng\u1ecdc Lam\" th\u1ec3 hi\u1ec7n s\u1ef1 y\u00eau qu\u00fd, h\u00e3nh di\u1ec7n & tr\u00e2n tr\u1ecdng m\u00e0 cha m\u1eb9 d\u00e0nh cho con c\u00e1i. \"Ng\u1ecdc Lam\" mang \u00fd ngh\u0129a con l\u00e0 vi\u00ean ng\u1ecdc qu\u00fd cao sang. Khi \u0111\u1eb7t t\u00ean \"Ng\u1ecdc Lam\" l\u00e0 b\u1ed1 m\u1eb9 mong cho con c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, phong c\u00e1ch qu\u00fd ph\u00e1i, cao sang, t\u00e2m h\u1ed3n trong s\u00e1ng nh\u01b0 ng\u1ecdc & lu\u00f4n g\u1eb7p may m\u1eafn, an l\u00e0nh.", "sex": 5}
