{"first_name": "Qu\u1ef3nh Lam", "meaning": "\"Qu\u1ef3nh\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa tao nh\u00e3 khi\u00eam nh\u01b0\u1eddng n\u1edf trong \u0111\u00eam, mang h\u01b0\u01a1ng th\u01a1m ng\u1ea1t ng\u00e0o. T\u00ean \"Qu\u1ef3nh Lam\" l\u00e0 \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p nh\u01b0ng kh\u00f4ng ki\u00eau k\u1ef3, b\u1ea3n t\u00ednh khi\u00eam nh\u01b0\u1eddng, t\u00e2m h\u1ed3n thanh tao, trong s\u00e1ng, m\u1ed9t ng\u01b0\u1eddi con g\u00e1i v\u1edbi ph\u1ea9m ch\u1ea5t \u0111\u1eb9p, nh\u01b0 ng\u1ecdc ng\u00e0 qu\u00fd b\u00e1u ch\u1ec9 d\u00e0nh cho nh\u1eefng ng\u01b0\u1eddi bi\u1ebft ch\u1edd \u0111\u1ee3i", "sex": 5}
