{"first_name": "Thanh Lam", "meaning": "\"Thanh\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t l\u00e0 trong s\u1ea1ch, li\u00eam khi\u1ebft. V\u00e0 \"Lam\" l\u00e0 m\u00e0u xanh c\u1ee7a lo\u1ea1i ng\u1ecdc may m\u1eafn, cao qu\u00fd. Thanh Lam mang \u00fd ngh\u0129a con qu\u00fd gi\u00e1 nh\u01b0 lo\u00e0i ng\u1ecdc & xinh \u0111\u1eb9p, tinh t\u1ebf, ph\u1ea9m h\u1ea1nh trong s\u1ea1ch, thanh cao", "sex": 5}
