{"first_name": "Thi\u00ean Lam", "meaning": "\"Thi\u00ean Lam\" c\u00f3 ngh\u0129a l\u00e0 vi\u00ean ng\u1ecdc qu\u00fd c\u1ee7a \u0111\u1ea5t tr\u1eddi. T\u00ean \"Thi\u00ean Lam\" mang \u00fd ngh\u0129a con s\u1ebd c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u00e2m h\u1ed3n trong s\u00e1ng, lu\u00f4n \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, n\u00e2ng niu nh\u01b0 ng\u1ecdc nh\u01b0 ng\u00e0", "sex": 5}
