{"first_name": "Tr\u00fac Lam", "meaning": "\"Tr\u00fac\": l\u00e0 c\u00e2y thu\u1ed9c h\u1ecd tre, l\u00e1 m\u1ecdc th\u00e0nh t\u1eebng ch\u00f9m \u1edf g\u1ea7n ng\u1ecdn c\u00e2y, th\u00e2n c\u00f3 nhi\u1ec1u \u0111\u1ed1t c\u00f3 m\u00e0u v\u00e0ng. Tr\u00fac l\u00e0 m\u1ed9t lo\u1ea1i c\u00e2y thu\u1ed9c b\u1ed9 t\u1ee9 qu\u00fd \"T\u00f9ng, C\u00fac, Tr\u00fac, Mai\", bi\u1ec3u t\u01b0\u1ee3ng cho ng\u01b0\u1eddi qu\u00e2n t\u1eed, s\u1ef1 thanh cao, ngay th\u1eb3ng, trung th\u1ef1c, th\u1eadt th\u00e0.\"Lam\" m\u00e0u xanh, \u0111\u1eadm h\u01a1n so v\u1edbi m\u00e0u xanh da tr\u1eddi, m\u00e0u c\u1ee7a may m\u1eafn. C\u00e1i t\u00ean \"Tr\u00fac Lam\" g\u1ee3i l\u00ean v\u1ebb \u0111\u1eb9p thanh cao c\u00f9ng b\u1ea3n t\u00ednh trung th\u1ef1c, th\u1eadt th\u00e0 trong t\u00e2m h\u1ed3n v\u00e0 c\u00f2n th\u1ec3 hi\u1ec7n mong mu\u1ed1n con lu\u00f4n g\u1eb7p may trong cu\u1ed9c s\u1ed1ng c\u1ee7a cha m\u1eb9.", "sex": 5}
{"first_name": "Tuy\u1ec1n Lam", "meaning": "\"Tuy\u1ec1n\" theo H\u00e1n vi\u1ec7t l\u00e0 su\u1ed1i, Lam l\u00e0 m\u00e0u xanh. Tuy\u1ec1n Lam ch\u1ec9 m\u1ed9t d\u00f2ng su\u1ed1i xanh bi\u1ebfc. \"Tuy\u1ec1n Lam\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho con g\u00e1i. V\u1edbi t\u00ean n\u00e0y cha m\u1eb9 g\u1eedi g\u1eafm \u01b0\u1edbc m\u01a1 mong cu\u1ed9c \u0111\u1eddi con sau n\u00e0y s\u1ebd trong s\u00e1ng, thanh cao, b\u00ecnh d\u1ecb nh\u01b0 d\u00f2ng su\u1ed1i trong xanh.", "sex": 5}
{"first_name": "\u00dd Lam", "meaning": "\u00dd l\u00e0 \u00fd ch\u00ed, th\u1ec3 hi\u1ec7n s\u1ef1 quy\u1ebft t\u00e2m & m\u1ea1nh m\u1ebd. Lam l\u00e0 ng\u1ecdc. \u00dd Lam c\u00f3 ngh\u0129a l\u00e0 con c\u00f3 \u00fd ch\u00ed ki\u00ean c\u01b0\u1eddng m\u1ea1nh m\u1ebd & dung m\u1ea1o xinh \u0111\u1eb9p, t\u01b0\u01a1ng lai may m\u1eafn. T\u00ean con l\u00e0 h\u1ed9i \u0111\u1ee7 nh\u1eefng y\u1ebfu t\u1ed1 h\u1ea1nh ph\u00fac m\u00e0 cha m\u1eb9 mong mu\u1ed1n", "sex": 5}
{"first_name": "Hoa L\u00e0i", "meaning": "\"Hoa L\u00e0i\" \u0111\u01a1n gi\u1ea3n nh\u01b0ng ng\u00e1t h\u01b0\u01a1ng. Ng\u01b0\u1eddi t\u00ean \"Hoa L\u00e0i\" gi\u1ea3n d\u1ecb, t\u00e2m h\u1ed3n trong s\u00e1ng v\u00e0 lu\u00f4n th\u01a1m th\u1ea3o nh\u01b0 ch\u00ednh lo\u00e0i hoa n\u00e0y", "sex": 5}
