{"first_name": "H\u1ea1 Ph\u1ea5n", "meaning": "Theo c\u00e1ch th\u00f4ng th\u01b0\u1eddng, \"H\u1ea1\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u00f9a h\u00e8, m\u1ed9t trong nh\u1eefng m\u00f9a s\u00f4i n\u1ed5i v\u1edbi nhi\u1ec1u ho\u1ea1t \u0111\u1ed9ng vui v\u1ebb c\u1ee7a n\u0103m. \"H\u1ea1 Ph\u1ea5n\" d\u00f9ng \u0111\u1ec3 di\u1ec5n t\u1ea3 v\u1ec1 v\u1ec1 m\u1ed9t m\u00f9a hoa c\u1ecf, ong b\u01b0\u1edbm c\u00f9ng nhau khoe s\u1eafc th\u1eafm. \u0110\u1eb7t con t\u00ean \"H\u1ea1 Ph\u1ea5n\" l\u00e0 mong con xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, lu\u00f4n vui v\u1ebb, b\u00ecnh an", "sex": 5}
{"first_name": "L\u1ec7 Ph\u1ea5n", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"L\u1ec7\" c\u00f3 ngh\u0129a l\u00e0 quy \u0111\u1ecbnh, l\u1ec1 l\u1ed1i, nh\u1eefng \u0111i\u1ec1u \u0111\u00e3 tr\u1edf th\u00e0nh n\u1ec1 n\u1ebfp m\u00e0 con ng\u01b0\u1eddi c\u1ea7n tu\u00e2n theo. T\u00ean \"L\u1ec7 Ph\u1ea5n\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi s\u1ed1ng n\u1ec1 n\u1ebfp, c\u00f3 th\u00f3i quen t\u1ed1t \u0111\u01b0\u1ee3c \u0111\u1ecbnh h\u00ecnh t\u1eeb nh\u1eefng h\u00e0nh \u0111\u1ed9ng tu d\u01b0\u1ee1ng h\u1eb1ng ng\u00e0y. Ngo\u00e0i ra, \"L\u1ec7 Ph\u1ea5n\" c\u00f2n l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 dung m\u1ea1o xinh \u0111\u1eb9p c\u1ee7a ng\u01b0\u1eddi con g\u00e1i", "sex": 5}
{"first_name": "Linh Ph\u1ea5n", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Linh\" c\u00f3 ngh\u0129a l\u00e0 c\u00e1i chu\u00f4ng nh\u1ecf \u0111\u00e1ng y\u00eau. V\u1ec1 t\u00ednh c\u00e1ch, trong ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Linh\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u1eb9n, th\u00f4ng minh.  \"Ph\u1ea5n\" hay c\u00f2n g\u1ecdi l\u00e0 ph\u1ea5n hoa c\u00f3 m\u00e0u s\u1eafc t\u01b0\u01a1i s\u00e1ng, ch\u1ee7 y\u1ebfu l\u00e0 c\u00e1c m\u00e0u: \u0111\u1ecf t\u01b0\u01a1i, tr\u1eafng ng\u00e0, v\u00e0ng s\u00e1ng, m\u00e0u ng\u0169 s\u1eafc... t\u00f9y theo m\u00f9a hoa; c\u00f3 v\u1ecb ng\u1ecdt, th\u01a1m ng\u1eady. Ng\u01b0\u1eddi t\u00ean \"Linh Ph\u1ea5n\" th\u01b0\u1eddng c\u00f3 n\u00e9t \u0111\u1eb9p tinh kh\u00f4i, d\u1ecbu d\u00e0ng, thanh l\u1ecbch v\u00e0 c\u00f3 t\u00e2m h\u1ed3n trong s\u00e1ng, nh\u00e2n h\u1eadu, lu\u00f4n g\u1eb7p may m\u1eafn, \u0111\u01b0\u1ee3c che ch\u1edf, gi\u00fap \u0111\u1ee1 trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
{"first_name": "Minh Ph\u1ea5n", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, Minh c\u00f2n c\u00f3 ngh\u0129a ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (B\u00ecnh Minh), th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. \"Ph\u1ea5n\" hay c\u00f2n g\u1ecdi l\u00e0 ph\u1ea5n hoa c\u00f3 m\u00e0u s\u1eafc t\u01b0\u01a1i s\u00e1ng, ch\u1ee7 y\u1ebfu l\u00e0 c\u00e1c m\u00e0u: \u0111\u1ecf t\u01b0\u01a1i, tr\u1eafng ng\u00e0, v\u00e0ng s\u00e1ng, m\u00e0u ng\u0169 s\u1eafc... t\u00f9y theo m\u00f9a hoa; c\u00f3 v\u1ecb ng\u1ecdt, th\u01a1m ng\u1eady. Ng\u01b0\u1eddi t\u00ean \"Minh Ph\u1ea5n\" th\u01b0\u1eddng c\u00f3 n\u00e9t \u0111\u1eb9p tinh kh\u00f4i, d\u1ecbu d\u00e0ng, thanh l\u1ecbch, tr\u00ed tu\u1ec7 th\u00f4ng minh, s\u00e1ng su\u1ed1t v\u00e0 c\u00f3 t\u00e2m h\u1ed3n trong s\u00e1ng, nh\u00e2n h\u1eadu.", "sex": 5}
{"first_name": "Ng\u1ecdc Ph\u1ea5n", "meaning": "\"Ng\u1ecdc\" theo ti\u1ebfng H\u00e1n vi\u1ec7t l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh,... th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed. T\u00ean Ng\u1ecdc Ph\u1ea5n th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, duy\u00ean d\u00e1ng, lu\u00f4n bi\u1ebft c\u00e1ch t\u1ecfa s\u00e1ng nh\u01b0 h\u00f2n ng\u1ecdc qu\u00fd. Cha m\u1eb9 mong con t\u00ean \"Ng\u1ecdc Ph\u1ea5n\" c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng cao sang, \u0111\u01b0\u1ee3c y\u00eau qu\u00fd, c\u01b0ng chi\u1ec1u", "sex": 5}
{"first_name": "Nh\u00e3 Ph\u1ea5n", "meaning": "Theo ngh\u0129a Ti\u1ebfng Vi\u1ec7t, \"Nh\u00e3\" c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 l\u1ecbch s\u1ef1, nh\u00e3 nh\u1eb7n, h\u00f2a nh\u00e3. \"Ph\u1ea5n\" hay c\u00f2n g\u1ecdi l\u00e0 ph\u1ea5n hoa c\u00f3 m\u00e0u s\u1eafc t\u01b0\u01a1i s\u00e1ng, ch\u1ee7 y\u1ebfu l\u00e0 c\u00e1c m\u00e0u: \u0111\u1ecf t\u01b0\u01a1i, tr\u1eafng ng\u00e0, v\u00e0ng s\u00e1ng, m\u00e0u ng\u0169 s\u1eafc... t\u00f9y theo m\u00f9a hoa; c\u00f3 v\u1ecb ng\u1ecdt, th\u01a1m ng\u1eady. Ng\u01b0\u1eddi t\u00ean \"Nh\u00e3 Ph\u1ea5n\" th\u01b0\u1eddng c\u00f3 n\u00e9t \u0111\u1eb9p tinh kh\u00f4i, d\u1ecbu d\u00e0ng, thanh l\u1ecbch v\u00e0 c\u00f3 t\u00e2m h\u1ed3n trong s\u00e1ng, nh\u00e2n h\u1eadu.", "sex": 5}
{"first_name": "Qu\u1ef3nh Ph\u1ea5n", "meaning": "\"Qu\u1ef3nh\" la\u0300 t\u00ean m\u1ed9t lo\u00e0i hoa th\u01b0\u1eddng hay n\u1edf v\u00e0o l\u00fac 12h \u0111\u00eam. Hoa qu\u1ef3nh c\u00f3 m\u00e0u tr\u1eafng tinh kh\u00f4i, c\u00f3 m\u00f9i h\u01b0\u01a1ng thanh khi\u1ebft, d\u1ecbu d\u00e0ng. \"Ph\u1ea5n\" hay c\u00f2n g\u1ecdi l\u00e0 ph\u1ea5n hoa c\u00f3 m\u00e0u s\u1eafc t\u01b0\u01a1i s\u00e1ng, ch\u1ee7 y\u1ebfu l\u00e0 c\u00e1c m\u00e0u: \u0111\u1ecf t\u01b0\u01a1i, tr\u1eafng ng\u00e0, v\u00e0ng s\u00e1ng, m\u00e0u ng\u0169 s\u1eafc... t\u00f9y theo m\u00f9a hoa; c\u00f3 v\u1ecb ng\u1ecdt, th\u01a1m ng\u1eady. \"Qu\u1ef3nh Ph\u1ea5n\" \u00fd ch\u1ec9 ph\u1ea5n c\u1ee7a hoa qu\u1ef3nh. Ng\u01b0\u1eddi t\u00ean \"Qu\u1ef3nh Ph\u1ea5n\" th\u01b0\u1eddng c\u00f3 n\u00e9t \u0111\u1eb9p tinh kh\u00f4i, d\u1ecbu d\u00e0ng, thanh l\u1ecbch v\u00e0 c\u00f3 t\u00e2m h\u1ed3n trong s\u00e1ng, nh\u00e2n h\u1eadu.", "sex": 5}
{"first_name": "Thanh Ph\u1ea5n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 thanh cao, trong s\u1ea1ch, thanh b\u1ea1ch. \"Ph\u1ea5n\" hay c\u00f2n g\u1ecdi l\u00e0 ph\u1ea5n hoa c\u00f3 m\u00e0u s\u1eafc t\u01b0\u01a1i s\u00e1ng, ch\u1ee7 y\u1ebfu l\u00e0 c\u00e1c m\u00e0u: \u0111\u1ecf t\u01b0\u01a1i, tr\u1eafng ng\u00e0, v\u00e0ng s\u00e1ng, m\u00e0u ng\u0169 s\u1eafc...t\u00f9y theo m\u00f9a hoa; c\u00f3 v\u1ecb ng\u1ecdt, th\u01a1m ng\u1eady. Ng\u01b0\u1eddi t\u00ean \"Thanh Ph\u1ea5n\" th\u01b0\u1eddng c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, thanh tao,kh\u00ed ch\u1ea5t \u0111i\u1ec1m \u0111\u1ea1m, nh\u1eb9 nh\u00e0ng v\u00e0 cao qu\u00fd", "sex": 5}
{"first_name": "Thi\u00ean Ph\u1ea5n", "meaning": "Theo ngh\u0129a  H\u00e1n-Vi\u1ec7t  \"Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eddi,  th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la.  \"Ph\u1ea5n\" hay c\u00f2n g\u1ecdi l\u00e0 ph\u1ea5n hoa c\u00f3 m\u00e0u s\u1eafc t\u01b0\u01a1i s\u00e1ng, ch\u1ee7 y\u1ebfu l\u00e0 c\u00e1c m\u00e0u: \u0111\u1ecf t\u01b0\u01a1i, tr\u1eafng ng\u00e0, v\u00e0ng s\u00e1ng, m\u00e0u ng\u0169 s\u1eafc... t\u00f9y theo m\u00f9a hoa; c\u00f3 v\u1ecb ng\u1ecdt, th\u01a1m ng\u1eady. Ng\u01b0\u1eddi t\u00ean \"Thi\u00ean Ph\u1ea5n\" th\u01b0\u1eddng c\u00f3 n\u00e9t \u0111\u1eb9p tinh kh\u00f4i, d\u1ecbu d\u00e0ng, thanh l\u1ecbch v\u00e0 c\u00f3 t\u00e2m h\u1ed3n trong s\u00e1ng, nh\u00e2n h\u1eadu, c\u00f3 c\u00e1i nh\u00ecn bao qu\u00e1t, r\u1ed9ng l\u1edbn.", "sex": 5}
{"first_name": "Thu Ph\u1ea5n", "meaning": "Theo ngh\u0129a Ti\u1ebfng Vi\u1ec7t, \"Thu\" l\u00e0 m\u00f9a thu, l\u00e0 m\u00f9a chuy\u1ec3n ti\u1ebfp t\u1eeb h\u1ea1 sang \u0111\u00f4ng, th\u1eddi ti\u1ebft d\u1ecbu m\u00e1t d\u1ea7n. Ngo\u00e0i ra, \"Thu\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 nh\u1eadn l\u1ea5y, nh\u1eadn v\u1ec1 t\u1eeb nhi\u1ec1u ngu\u1ed3n, nhi\u1ec1u n\u01a1i. T\u00ean \"Thu Ph\u1ea5n\" l\u00e0 mong cho con s\u1ebd trong s\u00e1ng, xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau nh\u01b0 kh\u00ed tr\u1eddi m\u00f9a thu, \u0111\u1ed3ng th\u1eddi con s\u1ebd lu\u00f4n nh\u1eadn \u0111\u01b0\u1ee3c nhi\u1ec1u s\u1ef1 y\u00eau th\u01b0\u01a1ng v\u00e0 may m\u1eafn", "sex": 5}
{"first_name": "Gi\u00e1n Ph\u1ea1m", "meaning": "Ph\u1ea1m l\u00e0 h\u1ea1n ch\u1ebf, chu\u1ea9n m\u1ef1c, Gi\u00e1n l\u00e0 can ng\u0103n. Ph\u1ea1m Gi\u00e1n \u00fd n\u00f3i cha m\u1eb9 nh\u1eafc nh\u1edf, khuy\u00ean r\u0103ng nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p \u0111\u1ebfn con, mong con lu\u00f4n s\u1ed1ng ch\u1eebng m\u1ef1c", "sex": 3}
{"first_name": "Ng\u1ecdc Ph\u00e1n", "meaning": "\"Ng\u1ecdc\" l\u00e0 \u0111\u00e1 qu\u00fd, \"Ng\u1ecdc Ph\u00e1n\" c\u00f3 ngh\u0129a ch\u1ec9 con ng\u01b0\u1eddi ph\u00e2n bi\u1ec7t minh b\u1ea1ch tr\u1eafng \u0111en, h\u00e0nh vi ch\u00ednh tr\u1ef1c.", "sex": 5}
