{"first_name": "Th\u1ea3o Ng\u00e2n", "meaning": "Ng\u00e2n l\u00e0 v\u00e0ng l\u00e0 ti\u1ec1n. Th\u1ea3o l\u00e0 hi\u1ebfu th\u1ea3o, ngoan hi\u1ec1n. Th\u1ea3o Ng\u00e2n ngh\u0129a l\u00e0 con l\u00e0 \u0111\u1ee9a con ngoan hi\u1ebfu th\u1ea3o c\u1ee7a cha m\u1eb9, t\u01b0\u01a1ng lai s\u1ebd gi\u00e0u sang sung s\u01b0\u1edbng.", "sex": 5}
{"first_name": "Th\u00f9y Ng\u00e2n", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 qu\u00fd b\u00e1u. Theo t\u1eeb \u0111i\u1ec3n Ti\u1ebfng Vi\u1ec7t, \"Th\u00f9y\" c\u00f3 ngh\u0129a l\u00e0 th\u00f9y m\u1ecb, n\u1ebft na, \u0111\u1eb1m th\u1eafm, d\u1ecbu d\u00e0ng, \u0111\u00e1ng y\u00eau. V\u1edbi t\u00ean \"Th\u00f9y Ng\u00e2n\" ng\u1ee5 \u00fd c\u1ee7a cha m\u1eb9 mong cho con c\u00f3 t\u01b0\u01a1ng lai \u1ea5m no, \u0111\u1ea7y \u0111\u1ee7, b\u1ea3n t\u00ednh ngoan hi\u1ec1n th\u00f9y m\u1ecb.", "sex": 5}
