{"first_name": "T\u00fa Ng\u00e2n", "meaning": "T\u00fa l\u00e0 sao, Ng\u00e2n l\u00e0 con s\u00f4ng. T\u00fa Ng\u00e2n l\u00e0 v\u00ec sao s\u00e1ng soi tr\u00ean con s\u00f4ng Ng\u00e2n h\u00e0, d\u1ef1a tr\u00ean h\u00ecnh \u1ea3nh n\u00e0y t\u00ean T\u00fa Ng\u00e2n mang \u00fd n\u00f3i con xinh \u0111\u1eb9p, hi\u1ec1n h\u00f2a.", "sex": 5}
