{"first_name": "Uy\u00ean Ng\u00e2n", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 qu\u00fd b\u00e1u. \"Uy\u00ean\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t l\u00e0 t\u00ean th\u01b0\u1eddng \u0111\u1eb7t cho ng\u01b0\u1eddi con g\u00e1i, \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \"Uy\u00ean Ng\u00e2n\" l\u00e0 b\u1ea3o b\u1ed1i c\u1ee7a ba m\u1eb9, mong con xinh \u0111\u1eb9p, qu\u00fd ph\u00e1i v\u00e0 gi\u00e0u c\u00f3.", "sex": 5}
{"first_name": "Uy\u1ec3n Ng\u00e2n", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 qu\u00fd b\u00e1u. \"Uy\u1ec3n\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t l\u00e0 nh\u1eb9 nh\u00e0ng, kh\u00fac chi\u1ebft uy\u1ec3n chuy\u1ec3n th\u1ec3 hi\u1ec7n s\u1ef1 thanh tao tinh t\u1ebf c\u00f2n c\u00f3 ngh\u0129a l\u00e0 \u0111\u1eb9p \u0111\u1ebd, h\u00f2a thu\u1eadn nh\u00fan nh\u01b0\u1eddng. \"Uy\u1ec3n Ng\u00e2n\" l\u00e0 b\u1ea3o b\u1ed1i c\u1ee7a ba m\u1eb9, mong con xinh \u0111\u1eb9p, thanh tao, uy\u1ec3n chuy\u1ec3n m\u1ec1m m\u1ea1i v\u00e0 t\u01b0\u01a1ng lai gi\u00e0u c\u00f3", "sex": 5}
{"first_name": "V\u0169 Ng\u00e2n", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a. \"V\u0169\" l\u00e0 m\u01b0a, l\u00e0 kh\u00fac nh\u1ea1c, \u0111\u1ed3ng th\u1eddi c\u0169ng bao h\u00e0m \u00fd ngh\u0129a to l\u1edbn, m\u1ea1nh m\u1ebd. V\u1edbi t\u00ean \"V\u0169 Ng\u00e2n\" cha m\u1eb9 mong con lu\u00f4n m\u1ea1nh m\u1ebd uy v\u0169 v\u00e0 c\u00f3 t\u01b0\u01a1ng lai sang gi\u00e0u.", "sex": 3}
{"first_name": "\u00dd Ng\u00e2n", "meaning": "Ng\u00e2n l\u00e0 ti\u1ec1n c\u1ee7a. \u00dd l\u00e0 nh\u01b0 \u00fd, thu\u1eadn theo mong mu\u1ed1n. \u00dd Ng\u00e2n ngh\u0129a l\u00e0 con s\u1ebd lu\u00f4n \u0111\u1ea1t \u0111\u01b0\u1ee3c \u0111i\u00ea\u0300u mong mu\u1ed1n, cu\u1ed9c s\u1ed1ng thu\u1eadn l\u1ee3i nh\u01b0 \u00fd, gi\u00e0u c\u00f3.", "sex": 5}
{"first_name": "\u1ef6 Ng\u00e2n", "meaning": "Ng\u00e2n l\u00e0 ti\u1ec1n c\u1ee7a. \u1ef6 l\u00e0 t\u1eeb nh\u1eb9 nh\u00e0ng, mang \u00fd hoa m\u1ef9 \u0111\u1ec3 l\u00e0m t\u00ean \u0111\u1ec7m cho ng\u01b0\u1eddi con g\u00e1i. Trong t\u00ean \u1ef6 Ng\u00e2n, ph\u1ea7n ngh\u0129a ch\u00ednh c\u1ee7a t\u00ean n\u1eb1m \u1edf t\u00ean Ng\u00e2n, ngh\u0129a l\u00e0 gi\u00e0u c\u00f3, \u0111\u1ea7y \u0111\u1ee7 ti\u1ec1n b\u1ea1c v\u1eadt ch\u1ea5t.", "sex": 5}
