{"first_name": "\u0110\u1ea1i Ph\u00e1p", "meaning": "\"\u0110\u1ea1i\" l\u00e0 l\u1edbn. \"\u0110\u1ea1i Ph\u00e1p\" l\u00e0 th\u01b0\u1ee3ng t\u00f4n ph\u00e1p lu\u1eadt, ch\u1ec9 v\u00e0o h\u00e0nh vi con ng\u01b0\u1eddi nh\u1eadn th\u1ee9c ch\u00ednh x\u00e1c v\u1ec1 tr\u00e1ch nhi\u1ec7m b\u1ed5n ph\u1eadn, h\u00e0nh x\u1eed t\u00f4n nghi\u00eam minh b\u1ea1ch.", "sex": 3}
{"first_name": "Minh Ph\u00e1p", "meaning": "\"Minh\" l\u00e0 s\u00e1ng t\u1ecf. \"Minh Ph\u00e1p\" l\u00e0 ph\u00e1p lu\u1eadt r\u00f5 r\u00e0ng, h\u00e0m \u00fd ng\u01b0\u1eddi \u00fd th\u1ee9c minh b\u1ea1ch, t\u00f4n tr\u1ecdng ph\u00e1p ch\u1ebf, h\u00e0nh x\u1eed c\u00f4ng minh.", "sex": 3}
{"first_name": "H\u1ea1 Ph\u1ea7n", "meaning": "Theo c\u00e1ch th\u00f4ng th\u01b0\u1eddng, \"H\u1ea1\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u00f9a h\u00e8, m\u1ed9t trong nh\u1eefng m\u00f9a s\u00f4i n\u1ed5i v\u1edbi nhi\u1ec1u ho\u1ea1t \u0111\u1ed9ng vui v\u1ebb c\u1ee7a n\u0103m. \"H\u1ea1 Ph\u1ea7n d\u00f9ng \u0111\u1ec3 di\u1ec5n t\u1ea3 v\u1ec1 v\u1ec1 m\u1ed9t m\u00f9a hoa c\u1ecf, ong b\u01b0\u1edbm c\u00f9ng nhau khoe s\u1eafc th\u1eafm. \u0110\u1eb7t con t\u00ean \"H\u1ea1 Ph\u1ea7n\" l\u00e0 mong con xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, lu\u00f4n vui v\u1ebb, b\u00ecnh an", "sex": 5}
{"first_name": "Quang L\u1eadp", "meaning": "Quang ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng. Quang L\u1eadp ng\u1ee5 \u00fd con ng\u01b0\u1eddi th\u1eb3ng th\u1eafn, trung th\u1ef1c r\u00f5 r\u00e0ng", "sex": 3}
{"first_name": "Qu\u1ed1c L\u1eadp", "meaning": "Qu\u1ed1c l\u00e0 n\u01b0\u1edbc nh\u00e0. Qu\u1ed1c L\u1eadp l\u00e0 non n\u01b0\u1edbc v\u1eefng b\u1ec1n, ch\u1ec9 ng\u01b0\u1eddi con trai ch\u00ed kh\u00ed hi\u00ean ngang, h\u00e0nh s\u1ef1 m\u1ea1nh m\u1ebd", "sex": 3}
{"first_name": "\u00c1i Phi", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\u00c1i\" c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a, \"Phi\" l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn v\u1ee3 c\u1ee7a vua, quan ng\u00e0y x\u01b0a, \u00fd ch\u1ec9 s\u1ef1 quy\u1ec1n qu\u00fd, cao sang. Th\u1eddi x\u01b0a, c\u00e1c v\u1ecb vua, quan th\u01b0\u1eddng g\u1ecdi v\u1ee3 m\u00ecnh l\u00e0 \"\u00c1i Phi\" \u0111\u1ec3 n\u00f3i l\u00ean s\u1ef1 y\u00eau th\u01b0\u01a1ng, s\u1ee7ng \u00e1i \u0111\u1ed1i v\u1edbi ng\u01b0\u1eddi v\u1ee3 \u1ea5y. \u0110\u1eb7t t\u00ean con l\u00e0 \"\u00c1i Phi\" v\u1edbi mong mu\u1ed1n con lu\u00f4n xinh \u0111\u1eb9p, \u0111oan trang, \u0111\u01b0\u1ee3c y\u00eau th\u01b0\u01a1ng v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng h\u00f4n nh\u00e2n th\u1eadt h\u1ea1nh ph\u00fac trong t\u01b0\u01a1ng lai.", "sex": 5}
{"first_name": "An Phi", "meaning": "An l\u00e0 b\u00ecnh y\u00ean. An Phi l\u00e0 c\u00e1nh bay an to\u00e0n, ch\u1ec9 con ng\u01b0\u1eddi chu to\u00e0n t\u1ed1t \u0111\u1eb9p", "sex": 5}
{"first_name": "Anh Phi", "meaning": "Ch\u1eef Anh theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 \u201cng\u01b0\u1eddi t\u00e0i gi\u1ecfi\u201d v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. Ch\u1eef \"Phi\" c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u01b0 bay - di chuy\u1ec3n v\u1edbi t\u1ed1c \u0111\u1ed9 cao, d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi nhanh nh\u1eb9n tr\u00f4ng suy ngh\u0129, t\u00ednh c\u00e1ch c\u0169ng nh\u01b0 h\u00e0nh \u0111\u1ed9ng. V\u1ebb ngo\u00e0i thanh t\u00fa, t\u00ednh kh\u00ed \u00f4n h\u00f2a. T\u00ean \"Anh Phi\" l\u00e0 \u0111i\u1ec1u m\u00e0 cha m\u1eb9 mong mu\u1ed1n con m\u00ecnh s\u1ebd th\u00f4ng minh,nhanh nh\u1eb9n, l\u00e0m \u0111\u01b0\u1ee3c nhi\u1ec1u \u0111i\u1ec1u phi th\u01b0\u1eddng v\u00e0 v\u01b0\u01a1n t\u1edbi nh\u1eefng t\u1ea7m cao.", "sex": 3}
{"first_name": "B\u1ea3o Phi", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, ch\u1eef \"B\u1ea3o\" th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o, \"Phi\" c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u01b0 bay- di chuy\u1ec3n v\u1edbi t\u1ed1c \u0111\u1ed9 cao, \u00fd n\u00f3i \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi nhanh nh\u1eb9n, lanh l\u1ee3i.  T\u00ean \"B\u1ea3o Phi\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con v\u1edbi h\u00e0m \u00fd con ch\u00ednh l\u00e0 b\u1ea3o v\u1eadt m\u00e0 b\u1ed1 m\u1eb9 lu\u00f4n n\u00e2ng niu, gi\u1eef g\u00ecn; mong con s\u1ebd th\u00f4ng minh, c\u00f3 tr\u00ed tu\u1ec7 v\u00e0 nhanh nh\u1eb9n.", "sex": 3}
{"first_name": "C\u1ea9m Phi", "meaning": "Ch\u1eef \"Phi\" theo ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u01b0 bay - di chuy\u1ec3n v\u1edbi t\u1ed1c \u0111\u1ed9 cao. C\u1ea9m c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. T\u00ean \"Phi C\u1ea9m\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi nhanh nh\u1eb9n tr\u00f4ng suy ngh\u0129, t\u00ednh c\u00e1ch c\u0169ng nh\u01b0 h\u00e0nh \u0111\u1ed9ng. V\u1ebb ngo\u00e0i thanh t\u00fa, t\u00ednh kh\u00ed \u00f4n h\u00f2a. T\u00ean \"Phi C\u1ea9m\" l\u00e0 \u0111i\u1ec1u m\u00e0 cha m\u1eb9 mong mu\u1ed1n con m\u00ecnh s\u1ebd th\u00f4ng minh,nhanh nh\u1eb9n, l\u00e0m \u0111\u01b0\u1ee3c nhi\u1ec1u \u0111i\u1ec1u phi th\u01b0\u1eddng v\u00e0 v\u01b0\u01a1n t\u1edbi nh\u1eefng t\u1ea7m cao r\u1ea1ng r\u1ee1.", "sex": 5}
{"first_name": "C\u00fac Phi", "meaning": "\"C\u00fac\" l\u00e0 t\u00ean c\u1ee7a m\u1ed9t trong b\u1ed1n lo\u1ea1i hoa trong b\u1ed9 t\u1ee9 qu\u00fd (Mai - Lan -Cuc - Tr\u00fac), v\u1edbi \u0111\u1eb7c t\u00ednh d\u00f9 c\u00e0nh c\u00f3 h\u00e9o kh\u00f4 th\u00ec l\u00e1 v\u00e0 hoa c\u00fac vaanc kh\u00f4ng r\u1eddi kh\u1ecfi c\u00e0nh nh\u01b0 ng\u01b0\u1eddi qu\u00e2n t\u1eed su\u1ed1t \u0111\u1eddi kh\u00f4ng t\u1eeb b\u1ecf l\u00fd t\u01b0\u1edfng c\u1ee7a m\u00ecnh. Ch\u1eef \"Phi\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi nhanh nh\u1eb9n tr\u00f4ng suy ngh\u0129, t\u00ednh c\u00e1ch c\u0169ng nh\u01b0 h\u00e0nh \u0111\u1ed9ng. V\u1ebb ngo\u00e0i thanh t\u00fa, t\u00ednh kh\u00ed \u00f4n h\u00f2a. \u0110\u1eb7t t\u00ean \"C\u00fac Phi\" cho con, b\u1ed1 m\u1eb9 mong mu\u1ed1n con m\u00ecnh s\u1ebd th\u00f4ng minh,nhanh nh\u1eb9n, l\u00e0m \u0111\u01b0\u1ee3c nhi\u1ec1u \u0111i\u1ec1u phi th\u01b0\u1eddng v\u00e0 v\u01b0\u01a1n t\u1edbi nh\u1eefng t\u1ea7m cao nh\u01b0ng lu\u00f4n \u0111i k\u00e8m v\u1edbi tr\u00e1i tim khoan dung lu\u00f4n r\u1ed9ng m\u1edf, trong tinh th\u1ea7n m\u1ea1nh m\u1ebd.", "sex": 5}
{"first_name": "C\u01b0\u1eddng Phi", "meaning": "Ch\u1eef \"Phi\" theo ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u01b0 bay - di chuy\u1ec3n v\u1edbi t\u1ed1c \u0111\u1ed9 cao. Ch\u1eef \"C\u01b0\u1eddng\" theo ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 l\u1ef1c l\u01b0\u1ee1ng, uy l\u1ef1c v\u1edbi ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i v\u1ec1 th\u1ec3 ch\u1ea5t, m\u1ea1nh kh\u1ecfe tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. T\u00ean \"Phi C\u01b0\u1eddng\" l\u00e0 \u0111i\u1ec1u m\u00e0 b\u1ed1 m\u1eb9 mong mu\u1ed1n con kh\u00f4ng ch\u1ec9 l\u00e0 ng\u01b0\u1eddi m\u1ea1nh m\u1ebd v\u1ec1 th\u1ec3 tr\u1ea1ng m\u00e0 c\u00f2n th\u00f4ng minh,nhanh nh\u1eb9n, l\u00e0m \u0111\u01b0\u1ee3c nhi\u1ec1u \u0111i\u1ec1u phi th\u01b0\u1eddng v\u00e0 v\u01b0\u01a1n t\u1edbi nh\u1eefng t\u1ea7m cao.", "sex": 3}
{"first_name": "\u0110i\u1ec7p Phi", "meaning": "Con l\u00e0 b\u01b0\u1edbm nh\u01b0ng kh\u00f4ng ph\u1ea3i l\u00e0 b\u01b0\u1edbm, con m\u1ea1nh m\u1ebd, s\u1ed1ng l\u00fd tr\u00ed nh\u01b0ng l\u00e0m vi\u1ec7c r\u1ea5t t\u00ecnh c\u1ea3m, con l\u00e0 ng\u01b0\u1eddi d\u1ec5 g\u1ea7n, d\u1ec5 s\u1ebb chia v\u00e0 l\u1ea1c quan.", "sex": 5}
{"first_name": "Giao Phi", "meaning": "Ch\u1eef \"Phi\" theo ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u01b0 bay - di chuy\u1ec3n v\u1edbi t\u1ed1c \u0111\u1ed9 cao. T\u00ean \"Phi\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi nhanh nh\u1eb9n tr\u00f4ng suy ngh\u0129, t\u00ednh c\u00e1ch c\u0169ng nh\u01b0 h\u00e0nh \u0111\u1ed9ng. \"Giao\" l\u00e0 t\u00ean c\u1ee7a lo\u00e0i c\u1ecf giao, mong manh, b\u00ecnh d\u1ecb nh\u01b0ng m\u1ea1nh m\u1ebd, \u00fd ch\u00ed. T\u00ean \"Phi Giao\" \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con v\u1edbi \u00fd ngh\u0129a mong con th\u00f4ng minh, xinh \u0111\u1eb9p, hi\u1ec1n l\u00e0nh, l\u00e0m \u0111\u01b0\u1ee3c nhi\u1ec1u \u0111i\u1ec1u phi th\u01b0\u1eddng, c\u1ee9ng c\u1ecfi, kh\u00f4ng d\u1ec5 \u0111\u1ea7u h\u00e0ng v\u00e0 c\u00f3 ti\u1ebfng t\u0103m v\u1eefng b\u1ec1n", "sex": 5}
{"first_name": "H\u1ea1 Phi", "meaning": "\"H\u1ea1\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u00f9a h\u00e8, m\u1ed9t trong nh\u1eefng m\u00f9a s\u00f4i n\u1ed5i v\u1edbi nhi\u1ec1u ho\u1ea1t \u0111\u1ed9ng vui v\u1ebb c\u1ee7a n\u0103m. T\u00ean \"H\u1ea1 Phi\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi nhanh nh\u1eb9n tr\u00f4ng suy ngh\u0129, t\u00ednh c\u00e1ch c\u0169ng nh\u01b0 h\u00e0nh \u0111\u1ed9ng. V\u1ebb ngo\u00e0i thanh t\u00fa, t\u00ednh kh\u00ed \u00f4n h\u00f2a", "sex": 5}
{"first_name": "Hi\u1ebfu Phi", "meaning": "Ch\u1eef \"hi\u1ebfu\"  theo ti\u1ebfng H\u00e1n - Vi\u1ec7t l\u00e0 n\u1ec1n t\u1ea3ng \u0111\u1ea1o \u0111\u1ee9c, g\u1eafn li\u1ec1n v\u1edbi nh\u00e2n c\u00e1ch l\u00e0m ng\u01b0\u1eddi theo t\u01b0 t\u01b0\u1edfng c\u1ee7a ng\u01b0\u1eddi ph\u01b0\u01a1ng \u0110\u00f4ng. \"Hi\u1ebfu\" th\u1ec3 hi\u1ec7n s\u1ef1 t\u00f4n k\u00ednh, qu\u00fd tr\u1ecdng, lu\u00f4n bi\u1ebft \u01a1n, ghi nh\u1edb nh\u1eefng b\u1eadc sinh th\u00e0nh, tr\u01b0\u1edfng b\u1ed1i, c\u00f3 c\u00f4ng \u01a1n v\u1edbi m\u00ecnh. T\u00ean \"Hi\u1ebfu Phi\" l\u00e0 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, nhanh nh\u1eb9n, hi\u1ebfu th\u1ea3o, hi\u1ebfu k\u00ednh, hi\u1ebfu trung", "sex": 7}
{"first_name": "H\u1ecfa Phi", "meaning": "H\u1ecfa ch\u1ec9 s\u1ef1 m\u00e3nh li\u1ec7t. T\u00ean \"H\u1ecfa Phi\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi nhanh nh\u1eb9n tr\u00f4ng suy ngh\u0129, t\u00ednh c\u00e1ch c\u0169ng nh\u01b0 h\u00e0nh \u0111\u1ed9ng. V\u1ebb ngo\u00e0i thanh t\u00fa, t\u00ednh kh\u00ed \u00f4n h\u00f2a", "sex": 5}
{"first_name": "Ho\u00e0ng Phi", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ho\u00e0ng\" c\u00f3 ngh\u0129a s\u00e1ng s\u1ee7a, r\u1ef1c r\u1ee1, \"Phi\" c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u01b0 bay. T\u00ean \"Ho\u00e0ng Phi\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi c\u00f3 ngo\u1ea1i h\u00ecnh kh\u00f4i ng\u00f4, tu\u1ea5n t\u00fa, suy ngh\u0129 s\u1eafc b\u00e9n, h\u00e0nh \u0111\u1ed9ng nhanh nh\u1eb9n, l\u00e0m vi\u1ec7c g\u00ec c\u0169ng ho\u00e0n th\u00e0nh xu\u1ea5t s\u1eafc, v\u01b0\u1ee3t tr\u1ed9i h\u01a1n ng\u01b0\u1eddi", "sex": 3}
