{"first_name": "Long Phi", "meaning": "Ch\u1eef \"Long\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t, c\u00f3 ngh\u0129a l\u00e0 con r\u1ed3ng. Ng\u01b0\u1eddi x\u01b0a n\u00f3i r\u1ed3ng l\u00e0m ra m\u00e2y v\u00e0 m\u01b0a, l\u00e0 m\u1ed9t trong b\u1ed1n gi\u1ed1ng linh (Long - L\u00e2n - Quy - Ph\u1ee5ng) - l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng cho vua, \u00fd n\u00f3i ng\u01b0\u1eddi t\u00e0i gi\u1ecfi phi th\u01b0\u1eddng. Ch\u1eef \"Phi\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u01b0 bay. T\u00ean \"Long Phi\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi phi th\u01b0\u1eddng, c\u00f3 d\u00f2ng d\u00f5i v\u1edbi vua ch\u00faa. Cha m\u1eb9 \u0111\u1eb7t t\u00ean con l\u00e0 \"Long Phi\" mong mu\u1ed1n con m\u00ecnh c\u00f3 cu\u1ed9c s\u1ed1ng gi\u00e0u sang, ph\u00fa qu\u00fd, t\u00e0i gi\u1ecfi v\u00e0 th\u00e0nh c\u00f4ng", "sex": 3}
{"first_name": "Nam Phi", "meaning": "Ch\u1eef \"Phi\" theo ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u01b0 bay - di chuy\u1ec3n v\u1edbi t\u1ed1c \u0111\u1ed9 cao. Ch\u1eef \"C\u01b0\u1eddng\" theo ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 l\u1ef1c l\u01b0\u1ee1ng, uy l\u1ef1c v\u1edbi ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i v\u1ec1 th\u1ec3 ch\u1ea5t, m\u1ea1nh kh\u1ecfe tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. T\u00ean \"Phi C\u01b0\u1eddng\" l\u00e0 \u0111i\u1ec1u m\u00e0 b\u1ed1 m\u1eb9 mong mu\u1ed1n con kh\u00f4ng ch\u1ec9 l\u00e0 ng\u01b0\u1eddi m\u1ea1nh m\u1ebd v\u1ec1 th\u1ec3 tr\u1ea1ng m\u00e0 c\u00f2n th\u00f4ng minh,nhanh nh\u1eb9n, l\u00e0m \u0111\u01b0\u1ee3c nhi\u1ec1u \u0111i\u1ec1u phi th\u01b0\u1eddng v\u00e0 v\u01b0\u01a1n t\u1edbi nh\u1eefng t\u1ea7m cao.", "sex": 3}
