{"first_name": "Nguy\u1ec7t Phi", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, nguy\u1ec7t l\u00e0 v\u1ea7ng tr\u0103ng, Tr\u0103ng c\u00f3 v\u1ebb \u0111\u1eb9p v\u00f4 c\u00f9ng b\u00ecnh d\u1ecb, m\u1ed9t v\u1ebb \u0111\u1eb9p kh\u00f4ng c\u1ea7n trang s\u1ee9c, \u0111\u1eb9p m\u1ed9t c\u00e1ch v\u00f4 t\u01b0, h\u1ed3n nhi\u00ean. Tr\u0103ng t\u01b0\u1ee3ng tr\u01b0ng cho v\u1ebb \u0111\u1eb9p h\u1ed3n nhi\u00ean n\u00ean tr\u0103ng ho\u00e0 v\u00e0o thi\u00ean nhi\u00ean, ho\u00e0 v\u00e0o c\u00e2y c\u1ecf. T\u00ean Nguy\u1ec7t Phi n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau", "sex": 5}
