{"first_name": "Y\u1ebfn Phi", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Y\u1ebfn\" l\u00e0 t\u00ean g\u1ecdi c\u1ee7a m\u1ed9t lo\u00e0i chim nh\u1ecf gi\u1ed1ng nh\u01b0 chim nh\u1ea1n, l\u00e0 m\u1ed9t trong nh\u1eefng lo\u00e0i bay nhanh nh\u1ea5t v\u00e0 \u1edf tr\u00ean kh\u00f4ng, \"Phi\" c\u00f3 ngh\u0129a l\u00e0 bay. \"Y\u1ebfn Phi\" g\u1ee3i \u0111\u1ebfn h\u00ecnh \u1ea3nh chim y\u1ebfn \u0111ang bay l\u01b0\u1ee3n t\u1ef1 do tr\u00ean kh\u00f4ng. T\u00ean \"Y\u1ebfn Phi\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n v\u1ec1 s\u1ef1 xinh \u0111\u1eb9p, duy\u00ean d\u00e1ng, uy\u1ec3n chuy\u1ec3n, t\u00ednh t\u00ecnh ngay th\u1eb3ng, ch\u00e2n th\u1eadt, \u0111\u1ed3ng th\u1eddi mong con c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean, \u0111\u1ec3 con c\u00f3 th\u1ec3 ch\u1ea1m t\u1edbi \u0111\u01b0\u1ee3c nh\u1eefng \u01b0\u1edbc m\u01a1, khao kh\u00e1t c\u1ee7a m\u00ecnh.", "sex": 5}
