{"first_name": "B\u1ea3o Qu\u00e2n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, ch\u1eef \"B\u1ea3o\" th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o, \"Qu\u00e2n\" c\u00f3 ngh\u0129a l\u00e0 Vua. T\u00ean \"B\u1ea3o Qu\u00e2n\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi \u00fd ngh\u0129a con l\u00e0 b\u00e1u v\u1eadt qu\u00fd gi\u00e1 \u0111\u1ed1i v\u1edbi cha m\u1eb9, mong con s\u1ebd th\u00f4ng minh, t\u00e0i tr\u00ed, l\u00e0m n\u00ean s\u1ef1 nghi\u1ec7p.", "sex": 3}
{"first_name": "B\u00ecnh Qu\u00e2n", "meaning": "\"B\u00ecnh\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 c\u00f4ng b\u1eb1ng, ngang nhau kh\u00f4ng thi\u00ean l\u1ec7ch, c\u00f4ng ch\u00ednh. \"Qu\u00e2n\" mang \u00fd ch\u1ec9 b\u1ea3n t\u00ednh th\u00f4ng minh, \u0111a t\u00e0i, nhanh tr\u00ed, \"Qu\u00e2n\" c\u00f2n ch\u1ec9 l\u00e0 vua, l\u00e0 ng\u01b0\u1eddi \u0111\u1ee9ng \u0111\u1ea7u \u0111i\u1ec1u h\u00e0nh \u0111\u1ea5t n\u01b0\u1edbc.  V\u00ec v\u1eady, t\u00ean \"B\u00ecnh Qu\u00e2n\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 c\u1ed1t c\u00e1ch, bi\u1ebft ph\u00e2n \u0111\u1ecbnh r\u1ea1ch r\u00f2i, t\u00ednh kh\u00ed \u00f4n h\u00f2a. \u0110\u00e2y la\u0300 t\u00ean du\u0300ng \u0111\u00ea\u0309 \u0111\u0103\u0323t cho con trai ngu\u0323 y\u0301 sau na\u0300y con se\u0303 la\u0300m n\u00ean nghi\u00ea\u0323p l\u01a1\u0301n nh\u01b0 b\u00e2\u0323c qu\u00e2n v\u01b0\u01a1ng bi\u0300nh tri\u0323 \u0111\u00e2\u0301t n\u01b0\u01a1\u0301c", "sex": 3}
