{"first_name": "\u0110\u0103ng Qu\u00e2n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Qu\u00e2n\" mang \u00fd ch\u1ec9 b\u1ea3n t\u00ednh th\u00f4ng minh, \u0111a t\u00e0i, nhanh tr\u00ed, s\u1ed1 thanh nh\u00e0n, ph\u00fa qu\u00fd, d\u1ec5 th\u00e0nh c\u00f4ng, ph\u00e1t t\u00e0i, ph\u00e1t l\u1ed9c, danh l\u1ee3i song to\u00e0n.\"\u0110\u0103ng\" c\u00f3 ngh\u0129a l\u00e0 ng\u1ecdn \u0111\u00e8n. T\u00ean \u0110\u0103ng d\u1ef1a tr\u00ean h\u00ecnh \u1ea3nh \u0111\u00f3 mang \u00fd ngh\u0129a l\u00e0 s\u1ef1 soi s\u00e1ng & tinh anh.\"Qu\u00e2n \u0110\u0103ng\" mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh \u0111a t\u00e0i, c\u00f3 t\u01b0\u01a1ng lai t\u01b0\u01a1i s\u00e1ng , th\u00e0nh c\u00f4ng trong cu\u1ed9c s\u1ed1ng ph\u00fac l\u1ed9c an nh\u00e0n.", "sex": 3}
{"first_name": "\u0110\u00ecnh Qu\u00e2n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Qu\u00e2n\" mang \u00fd ch\u1ec9 b\u1ea3n t\u00ednh th\u00f4ng minh, \u0111a t\u00e0i, nhanh tr\u00ed, s\u1ed1 thanh nh\u00e0n, ph\u00fa qu\u00fd, d\u1ec5 th\u00e0nh c\u00f4ng, ph\u00e1t t\u00e0i, ph\u00e1t l\u1ed9c, danh l\u1ee3i song to\u00e0n.\"\u0110\u00ecnh\" th\u1ec3 hi\u1ec7n s\u1ef1 m\u1ea1nh m\u1ebd, v\u1eefng ch\u1eafc \u00fd ch\u1ec9 con l\u00e0 ng\u01b0\u1eddi m\u1ecdi ng\u01b0\u1eddi c\u00f3 th\u1ec3 tr\u00f4ng c\u1eady. \u0110\u00ecnh trong H\u00e1n vi\u1ec7t c\u00f2n c\u00f3 ngh\u0129a l\u00e0 \u1ed5n th\u1ecfa, th\u00f2a \u0111\u00e1ng th\u1ec3 hi\u1ec7n s\u1ef1 s\u1eafp x\u1ebfp \u00eam \u1ea5m.\"Qu\u00e2n \u0110\u00ecnh\" tuocon l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh , \u0111a t\u00e0i t\u01b0\u01a1ng lai con s\u1ebd th\u00e0nh c\u00f4ng \u0111em l\u1ea1i s\u1ef1 gi\u00e0u sang ph\u00fa qu\u00fd, ph\u00e1t t\u00e0i ph\u00e1t l\u1ed9c.", "sex": 3}
