{"first_name": "D\u01b0\u01a1ng Qu\u00e2n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"D\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng m\u1eb7t tr\u1eddi, \u0111\u1ea1i d\u01b0\u01a1ng, \"Qu\u00e2n\" c\u00f3 ngh\u0129a l\u00e0 vua, \u00fd ch\u1ec9 s\u1ef1 t\u00e0i gi\u1ecfi, xu\u1ea5t ch\u00fang. \"D\u01b0\u01a1ng Qu\u00e2n\" c\u00f3 ngh\u0129a l\u00e0 v\u1ecb vua c\u1ee7a bi\u1ec3n ho\u1eb7c vua c\u1ee7a \u00e1nh m\u1eb7t tr\u1eddi. T\u00ean \"D\u01b0\u01a1ng Qu\u00e2n\" n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, t\u00e0i gi\u1ecfi h\u01a1n ng\u01b0\u1eddi, b\u1ea3n l\u0129nh v\u00e0 m\u1ea1nh m\u1ebd.", "sex": 3}
