{"first_name": "Hi\u1ec3u Qu\u00e2n", "meaning": "\"Hi\u1ec3u\" l\u00e0 bu\u1ed5i s\u1edbm. \"Hi\u1ec3u Qu\u00e2n\" ngh\u0129a l\u00e0 v\u1ecb vua tr\u1ebb m\u1edbi \u0111\u0103ng quang, ng\u1ee5 \u00fd con s\u1ebd l\u00e0 ng\u01b0\u1eddi c\u00f3 \u0111\u1ee9c \u0111\u1ed9 t\u00e0i c\u00e1n h\u01a1n ng\u01b0\u1eddi.", "sex": 7}
