{"first_name": "M\u1ea1nh Qu\u00e2n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Qu\u00e2n\" c\u00f3 ngh\u0129a l\u00e0 vua, ng\u01b0\u1eddi \u0111\u1ee9ng \u0111\u1ea7u m\u1ed9t \u0111\u1ea5t n\u01b0\u1edbc phong ki\u1ebfn. Ngo\u00e0i ra, \"Qu\u00e2n\" c\u00f2n c\u00f3 ngh\u0129a nh\u01b0 qu\u00e2n \u0111\u1ed9i, l\u1ef1c l\u01b0\u1ee3ng v\u0169 trang. \"M\u1ea1nh Qu\u00e2n\" c\u00f3 th\u1ec3 hi\u1ec3u ngh\u0129a l\u00e0 m\u1ed9t v\u1ecb vua quy\u1ec1n l\u1ef1c ho\u1eb7c m\u1ed9t qu\u00e2n \u0111\u1ed9i h\u00f9ng m\u1ea1nh. \"M\u1ea1nh Qu\u00e2n\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi \u00fd ngh\u0129a mong con lu\u00f4n anh minh, m\u1ea1nh kh\u1ecfe, b\u1ea3n l\u0129nh v\u00e0 ki\u00ean c\u01b0\u1eddng.", "sex": 3}
