{"first_name": "Nam Qu\u00e2n", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Qu\u00e2n \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd l\u00e0 m\u1ed9t v\u1ecb nam t\u1eed h\u00e1n \u0111\u1ea1i tr\u01b0\u01a1ng phu, l\u00e0m vi\u1ec7c ch\u00ednh ngh\u0129a, danh l\u1ee3i song to\u00e0n.", "sex": 3}
{"first_name": "Nguy\u1ec7t Qu\u00e2n", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, nguy\u1ec7t l\u00e0 v\u1ea7ng tr\u0103ng, Tr\u0103ng c\u00f3 v\u1ebb \u0111\u1eb9p v\u00f4 c\u00f9ng b\u00ecnh d\u1ecb, m\u1ed9t v\u1ebb \u0111\u1eb9p kh\u00f4ng c\u1ea7n trang s\u1ee9c, \u0111\u1eb9p m\u1ed9t c\u00e1ch v\u00f4 t\u01b0, h\u1ed3n nhi\u00ean. Tr\u0103ng t\u01b0\u1ee3ng tr\u01b0ng cho v\u1ebb \u0111\u1eb9p h\u1ed3n nhi\u00ean n\u00ean tr\u0103ng ho\u00e0 v\u00e0o thi\u00ean nhi\u00ean, ho\u00e0 v\u00e0o c\u00e2y c\u1ecf. T\u00ean Nguy\u1ec7t Qu\u00e2n ngo\u00e0i \u00fd ngh\u0129a n\u00f3i v\u1ec1 n\u00e9t \u0111\u1eb9p ng\u00e2y th\u01a1, h\u1ed3n nhi\u00ean, v\u00f4 t\u01b0, y\u00eau \u0111\u1eddi c\u1ee7a ng\u01b0\u1eddi con g\u00e1i, c\u00f2n to\u00e1t l\u00ean s\u1ef1 ki\u00ean c\u01b0\u1eddng, b\u1ea3n l\u0129nh, kh\u00f4ng ng\u1ea1i kh\u00f3 kh\u0103n, gian kh\u1ed5", "sex": 5}
{"first_name": "Nh\u1eadt Qu\u00e2n", "meaning": "\"Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\"Nh\u1eadt\"\" c\u00f3 ngh\u0129a l\u00e0 m\u1eb7t tr\u1eddi, \"\"Qu\u00e2n\"\" c\u00f3 ngh\u0129a l\u00e0 vua. \"\"Nh\u1eadt Qu\u00e2n\"\" l\u00e0 vua m\u1eb7t tr\u1eddi.\r\n\"\"Nh\u1eadt Qu\u00e2n\"\" l\u00e0 c\u00e1i t\u00ean mang nh\u1eefng g\u1eedi g\u1eafm c\u1ee7a cha m\u1eb9 mong con sau n\u00e0y s\u1ebd gi\u1ecfi giang, th\u00e0nh \u0111\u1ea1t, t\u1ecfa s\u00e1ng nh\u01b0 m\u1eb7t tr\u1eddi, lu\u00f4n l\u00e0 ni\u1ec1m t\u1ef1 h\u00e0o c\u1ee7a cha m\u1eb9.\"", "sex": 3}
