{"first_name": "Thanh Qu\u00e2n", "meaning": "\"Thanh\" l\u00e0 m\u00e0u xanh, trong s\u1ea1ch, thanh cao, li\u00eam khi\u1ebft. \"Qu\u00e2n\" l\u00e0 vua, d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi, t\u00e0i \u0111\u1ee9c v\u1eb9n to\u00e0n, qu\u00e2n t\u1eed, c\u00f3 kh\u00ed ph\u00e1ch. T\u00ean \"Thanh Qu\u00e2n\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, \u0111a t\u00e0i, c\u1ed1t c\u00e1ch \u0111i\u1ec1m \u0111\u1ea1m, thanh cao, \u0111\u00e1ng t\u00f4n tr\u1ecdng", "sex": 3}
{"first_name": "Thi\u1ebfu Qu\u00e2n", "meaning": "\"Thi\u1ebfu\" l\u00e0 nh\u1ecf b\u00e9. \"Thi\u1ebfu Qu\u00e2n\" ngh\u0129a l\u00e0 v\u1ecb vua tr\u1ebb, ch\u1ec9 v\u1ec1 con ng\u01b0\u1eddi c\u00f3 ph\u1ea9m ch\u1ea5t t\u00f4n qu\u00fd.", "sex": 3}
{"first_name": "Tri\u1ec1u Qu\u00e2n", "meaning": "\"Tri\u1ec1u\" l\u00e0 tri\u1ec1u \u0111\u00ecnh. \"Tri\u1ec1u Qu\u00e2n\" ng\u1ee5 \u00fd ng\u01b0\u1eddi t\u00e0i gi\u1ecfi l\u00e0m vua ch\u1ed1n tri\u1ec1u c\u01b0\u01a1ng.", "sex": 3}
