{"first_name": "Vi\u1ec7t Qu\u1ebf", "meaning": "\"Vi\u1ec7t\" l\u00e0 d\u00e2n t\u1ed9c Vi\u1ec7t. \"Vi\u1ec7t Qu\u1ebf\" ngh\u0129a l\u00e0 c\u00e2y qu\u1ebf \u0111\u1ea5t Vi\u1ec7t, ch\u1ec9 v\u00e0o ng\u01b0\u1eddi con g\u00e1i trung ch\u00ednh hi\u1ec1n l\u01b0\u01a1ng, th\u00f9y m\u1ecb k\u00edn \u0111\u00e1o.", "sex": 5}
{"first_name": "B\u00e1 Qu\u00e1t", "meaning": "\"B\u00e1\" l\u00e0 to l\u1edbn. \"B\u00e1 Qu\u00e1t\" ch\u1ec9 ng\u01b0\u1eddi con trai c\u00f3 t\u00e0i l\u1ef1c to l\u1edbn, hi\u1ec3u bi\u1ebft s\u00e2u r\u1ed9ng, t\u1ea7m nh\u00ecn s\u00e1ng su\u1ed1t.", "sex": 3}
