{"first_name": "An Quy", "meaning": "An l\u00e0 b\u00ecnh y\u00ean, An Quy l\u00e0 b\u00ecnh y\u00ean quay v\u1ec1, ch\u1ec9 v\u00e0o \u0111i\u1ec1u may m\u1eafn t\u1ed1t \u0111\u1eb9p", "sex": 7}
