{"first_name": "An Qu\u1ed1c", "meaning": "\"An\" theo ngh\u0129a H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 nh\u1eb9 nh\u00e0ng, an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3, \"Qu\u1ed1c\" l\u00e0 \u0111\u1ea5t n\u01b0\u1edbc, l\u00e0 qu\u1ed1c gia, d\u00e2n t\u1ed9c, mang \u00fd ngh\u0129a to l\u1edbn, nh\u1eb1m g\u1eedi g\u1eafm nh\u1eefng \u0111i\u1ec1u cao c\u1ea3, l\u1edbn lao. T\u00ean \"An Qu\u1ed1c\" \u00fd ch\u1ec9 mong \u01b0\u1edbc con s\u1ebd l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi c\u00f3 th\u1ec3 l\u00e3nh \u0111\u1ea1o qu\u1ed1c gia.", "sex": 3}
