{"first_name": "Di\u1ec7u Qu\u1ed1c", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Di\u1ec7u\"c\u00f3 ngh\u0129a l\u00e0 \u0111\u1eb9p, l\u00e0 tuy\u1ec7t di\u1ec7u, \u00fd ch\u1ec9 nh\u1eefng \u0111i\u1ec1u tuy\u1ec7t v\u1eddi \u0111\u01b0\u1ee3c t\u1ea1o n\u00ean b\u1edfi s\u1ef1 kh\u00e9o l\u00e9o, k\u00ec di\u1ec7u. \"Qu\u1ed1c \" ngh\u0129a l\u00e0 qu\u1ed1c gia, \u0111\u1ea5t n\u01b0\u1edbc, \"\u0111\u1ea1o\" ngh\u0129a l\u00e0 con \u0111\u01b0\u1eddng, l\u00e0 h\u01b0\u1edbng \u0111i ch\u1ec9 l\u1ed1i cho con ng\u01b0\u1eddi \u0111i \u0111\u00fang h\u01b0\u1edbng  v\u00e0 r\u1ea1ng r\u1ee1 cho b\u1ea3n th\u00e2n m\u00ecnh. \"Di\u1ec7u Qu\u1ed1c\" c\u00f3 ngh\u0129a l\u00e0 cu\u1ed9c s\u1ed1ng \u1ea5m no. T\u00ean \"Di\u1ec7u Qu\u1ed1c\" mang \u00fd ngh\u0129a con s\u1ebd th\u1ef1c hi\u1ec7n \u0111\u01b0\u1ee3c nh\u1eefng \u01b0\u1edbc m\u01a1 l\u1edbn trong \u0111\u1eddi. Ch\u00fac con l\u00e0 m\u1ed9t \u0111\u1ee9a tr\u1ebb kh\u1ecfe m\u1ea1nh th\u00e0nh c\u00f4ng", "sex": 3}
