{"first_name": "\u0110\u1ecbnh Qu\u1ed1c", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Qu\u1ed1c \" ngh\u0129a l\u00e0 qu\u1ed1c gia, \u0111\u1ea5t n\u01b0\u1edbc,\"\u0110\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 ki\u00ean \u0111\u1ecbnh, kh\u00f4ng \u0111\u1ed5i d\u1eddi, b\u1ea5t bi\u1ebfn. T\u00ean \u0110\u1ecbnh \u00fd ch\u1ec9 v\u1ec1 t\u00ednh c\u00e1ch con ng\u01b0\u1eddi ki\u00ean \u0111\u1ecbnh, r\u1ea1ch r\u00f2i.\"Qu\u1ed1c \u0110\u1ecbnh\" mong mu\u1ed1n con c\u00f3 \u00fd ch\u00ed ki\u00ean c\u01b0\u1eddng, kh\u00f4ng thay \u0111\u1ed5i tr\u01b0\u1edbc m\u1ecdi ho\u00e0n c\u00e0nh, l\u00e0 ng\u01b0\u1eddi c\u00f3 th\u1ec3 l\u00e0m \u0111\u01b0\u1ee3c vi\u1ec7c l\u1edbn cho qu\u1ed1c gia.", "sex": 3}
