{"first_name": "D\u0169ng Qu\u1ed1c", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"D\u0169ng\" l\u00e0 s\u1ee9c m\u1ea1nh, can \u0111\u1ea3m ng\u01b0\u1eddi c\u00f3 kh\u00ed ph\u00e1ch, ng\u01b0\u1eddi gan d\u1ea1, d\u0169ng kh\u00ed, \"Qu\u1ed1c\" ngh\u0129a l\u00e0 qu\u1ed1c gia, \u0111\u1ea5t n\u01b0\u1edbc. T\u00ean \"Qu\u1ed1c D\u0169ng\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi anh d\u0169ng, t\u00e0i gi\u1ecfi xu\u1ea5t ch\u00fang, c\u00f3 th\u1ec3 \u0111\u1ea3m nh\u1eadn nh\u1eefng c\u00f4ng vi\u1ec7c to l\u1edbn c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc.", "sex": 3}
{"first_name": "Duy Qu\u1ed1c", "meaning": "Duy trong ti\u1ebfng h\u00e1n vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u01b0 duy, suy ngh\u0129 th\u1ea5u \u0111\u00e1o. Qu\u1ed1c l\u00e0 \u0111\u1ea5t n\u01b0\u1edbc, l\u00e0 qu\u1ed1c gia, d\u00e2n t\u1ed9c, mang \u00fd ngh\u0129a to l\u1edbn, l\u1edbn lao. \u0110\u1eb7t t\u00ean \"Duy Qu\u1ed1c\" l\u00e0 mong mu\u1ed1n con s\u1ebd th\u00f4ng minh, t\u00e0i gi\u1ecfi, l\u00e0m \u0111\u01b0\u1ee3c nh\u1eefng vi\u1ec7c l\u1edbn l\u00e1o, \u0111\u01b0\u1ee3c nhi\u1ec1u ph\u00fac l\u1ed9c to l\u1edbn, cu\u1ed9c s\u1ed1ng \u0111\u1ea7y \u0111\u1ee7, vi\u00ean m\u00e3n", "sex": 3}
{"first_name": "Gia Qu\u1ed1c", "meaning": "Theo ti\u1ebfng h\u00e1n vi\u1ec7t Qu\u1ed1c l\u00e0 \u0111\u1ea5t n\u01b0\u1edbc, l\u00e0 qu\u1ed1c gia, d\u00e2n t\u1ed9c, mang \u00fd ngh\u0129a to l\u1edbn, nh\u1eb1m g\u1eedi g\u1eafm nh\u1eefng \u0111i\u1ec1u cao c\u1ea3. \"Gia\" trong ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f2n l\u00e0 gia \u0111\u00ecnh, l\u00e0 m\u00e1i nh\u00e0 n\u01a1i m\u1ecdi ng\u01b0\u1eddi sum v\u1ea7y, sinh ho\u1ea1t b\u00ean nhau. Ngo\u00e0i ra ch\u1eef Gia c\u00f2n c\u00f3 ngh\u0129 l\u00e0 xinh \u0111\u1eb9p, \u01b0u t\u00fa, mang ph\u1ea9m ch\u1ea5t cao qu\u00fd.  \"Qu\u1ed1c Gia\" mang \u00fd ngh\u0129a t\u1ef1 h\u00e0o, t\u1ea7m v\u00f3c to l\u1edbn, mong con c\u00f3 th\u1ec3 l\u00e0m n\u00ean \u0111\u01b0\u1ee3c nh\u1eefng \u0111i\u1ec1u cao c\u1ea3, gi\u00fap \u00edch cho \u0111\u1ea5t n\u01b0\u1edbc.", "sex": 3}
{"first_name": "Giang Qu\u1ed1c", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Giang\"c\u00f3 ngh\u0129a l\u00e0 \u0111\u1eb9p, l\u00e0 tuy\u1ec7t di\u1ec7u, \u00fd ch\u1ec9 nh\u1eefng \u0111i\u1ec1u tuy\u1ec7t v\u1eddi \u0111\u01b0\u1ee3c t\u1ea1o n\u00ean b\u1edfi s\u1ef1 kh\u00e9o l\u00e9o, k\u00ec di\u1ec7u. \"Qu\u1ed1c \" ngh\u0129a l\u00e0 qu\u1ed1c gia, \u0111\u1ea5t n\u01b0\u1edbc, \"Qu\u1ed1c Giang\" c\u00f3 ngh\u0129a l\u00e0 cu\u1ed9c s\u1ed1ng \u1ea5m no. T\u00ean \"Qu\u1ed1c Giang\" mang \u00fd ngh\u0129a con s\u1ebd th\u1ef1c hi\u1ec7n \u0111\u01b0\u1ee3c nh\u1eefng \u01b0\u1edbc m\u01a1 l\u1edbn trong \u0111\u1eddi. Ch\u00fac con l\u00e0 m\u1ed9t \u0111\u1ee9a tr\u1ebb kh\u1ecfe m\u1ea1nh th\u00e0nh c\u00f4ng.", "sex": 3}
