{"first_name": "Hi\u1ebfu Qu\u1ed1c", "meaning": "Ch\u1eef \"hi\u1ebfu\"  theo ti\u1ebfng H\u00e1n - Vi\u1ec7t l\u00e0 n\u1ec1n t\u1ea3ng \u0111\u1ea1o \u0111\u1ee9c, g\u1eafn li\u1ec1n v\u1edbi nh\u00e2n c\u00e1ch l\u00e0m ng\u01b0\u1eddi theo t\u01b0 t\u01b0\u1edfng c\u1ee7a ng\u01b0\u1eddi ph\u01b0\u01a1ng \u0110\u00f4ng. \"Hi\u1ebfu\" th\u1ec3 hi\u1ec7n s\u1ef1 t\u00f4n k\u00ednh, qu\u00fd tr\u1ecdng, lu\u00f4n bi\u1ebft \u01a1n, ghi nh\u1edb nh\u1eefng b\u1eadc sinh th\u00e0nh, tr\u01b0\u1edfng b\u1ed1i, c\u00f3 c\u00f4ng \u01a1n v\u1edbi m\u00ecnh. T\u00ean \"Hi\u1ebfu Qu\u1ed1c\" l\u00e0 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi c\u00f3 t\u00e0i n\u0103ng, gi\u1ecfi giang. Cha m\u1eb9 mong con s\u1ebd th\u00e0nh t\u00e0i, l\u00e0m \u0111\u01b0\u1ee3c nh\u1eefng vi\u1ec7c v\u0129 \u0111\u1ea1i \u0111\u1ec3 c\u1ed1ng hi\u1ebfn cho T\u1ed5 Qu\u1ed1c, \u0111\u1ea5t n\u01b0\u1edbc m\u00ecnh", "sex": 3}
