{"first_name": "Kh\u01b0\u01a1ng Qu\u1ed1c", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Qu\u1ed1c \" ngh\u0129a l\u00e0 qu\u1ed1c gia, \u0111\u1ea5t n\u01b0\u1edbc,\"Kh\u01b0\u01a1ng\" c\u0169ng mang \u00fd ngh\u0129a nh\u01b0 ch\u1ec9 s\u1ef1 y\u00ean \u1ed5n, an b\u00ecnh ho\u1eb7c \u0111\u01b0\u1ee3c d\u00f9ng khi n\u00f3i \u0111\u1ebfn s\u1ef1 gi\u00e0u c\u00f3, \u0111\u1ee7 \u0111\u1ea7y.\"Kh\u01b0\u01a1ng Qu\u1ed1c\" mang \u00fd ngh\u0129a con l\u00e0 ng\u01b0\u1eddi \u0111a t\u00e0i nhanh tr\u00ed, t\u00ednh t\u00ecnh m\u1ea1nh m\u1ebd, c\u00f3 b\u1ea3n l\u0129nh, ba m\u1eb9 hy v\u1ecdng con sau n\u00e0y s\u1ebd l\u00e0m n\u00ean vi\u1ec7c l\u1edbn", "sex": 3}
