{"first_name": "Nam Qu\u1ed1c", "meaning": "\"Nam Qu\u1ed1c\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t nh\u1eb1m th\u1ec3 hi\u1ec7n t\u00ecnh y\u00eau \u0111\u1ea5t n\u01b0\u1edbc c\u1ee7a ba m\u1eb9, v\u00e0 ba m\u1eb9 mong con c\u0169ng y\u00eau qu\u00fd \u0111\u1ea5t n\u01b0\u1edbc m\u00ecnh. \u0110\u1eb7t t\u00ean \"Nam Qu\u1ed1c\" nh\u01b0 l\u1eddi nh\u1eafn, l\u1eddi d\u1ea1y c\u1ee7a cha m\u1eb9 ch\u1ec9 d\u1eabn \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn cho con tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a", "sex": 3}
{"first_name": "Thanh Qu\u1ed1c", "meaning": "Theo ti\u1ebfng h\u00e1n vi\u1ec7t Qu\u1ed1c l\u00e0 \u0111\u1ea5t n\u01b0\u1edbc, l\u00e0 qu\u1ed1c gia, d\u00e2n t\u1ed9c, mang \u00fd ngh\u0129a to l\u1edbn, nh\u1eb1m g\u1eedi g\u1eafm nh\u1eefng \u0111i\u1ec1u cao c\u1ea3, l\u1edbn lao n\u00ean th\u01b0\u1eddng d\u00f9ng \u0111\u1eb7t t\u00ean cho con trai \u0111\u1ec3 hi v\u1ecdng mai sau c\u00f3 th\u1ec3 l\u00e0m n\u00ean vi\u1ec7c l\u1edbn. K\u1ebft h\u1ee3p ch\u1eef \"Thanh\" nh\u1eb1m mong con s\u1ebd c\u00f3 c\u1ed1t c\u00e1ch thanh cao, s\u1ed1ng trong s\u1ea1ch v\u00e0 li\u00eam khi\u1ebft", "sex": 3}
