{"first_name": "Linh L\u00e2m", "meaning": "\"Linh\" c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u1eb9n, th\u00f4ng minh, h\u01b0\u1edbng v\u1ec1 nh\u1eefng \u0111i\u1ec1u t\u1ed1t l\u00e0nh. Linh L\u00e2m ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi dung m\u1ea1o \u0111\u00e1ng y\u00eau, t\u00e0i hoa, tinh anh, nhanh nh\u1eb9n, th\u00f4ng minh & lu\u00f4n g\u1eb7p may m\u1eafn trong cu\u1ed9c s\u1ed1ng", "sex": 5}
{"first_name": "Long L\u00e2m", "meaning": "\"Long\" \u00fd ngh\u0129a l\u00e0 s\u1ef1 oai v\u1ec7, uy nghi\u00eam, t\u01b0\u1ee3ng tr\u01b0ng cho b\u1eadc vua ch\u00faa. Long L\u00e2m, t\u00ean c\u1ee7a m\u1ed9t ng\u01b0\u1eddi con trai c\u00f3 t\u00ednh c\u00e1ch m\u1ea1nh m\u1ebd, phi th\u01b0\u1eddng, t\u00e0i gi\u1ecfi, tr\u00ed tu\u1ec7 anh minh, ch\u1ee9c cao v\u1ecdng tr\u1ecdng, c\u00f3 \u0111\u1ecba v\u1ecb trong x\u00e3 h\u1ed9i.", "sex": 3}
{"first_name": "L\u01b0\u01a1ng L\u00e2m", "meaning": "\"L\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 ng\u01b0\u1eddi t\u1ed1t l\u00e0nh, \u0111\u1ee9c t\u00ednh t\u00e0i gi\u1ecfi, tr\u00ed tu\u1ec7 \u0111\u01b0\u1ee3c tr\u1eddi ph\u00fa. L\u01b0\u01a1ng L\u00e2m, \u00fd ch\u1ec9 m\u1ed9t con ng\u01b0\u1eddi c\u00f3 b\u1ea3n ch\u1ea5t l\u01b0\u01a1ng thi\u1ec7n, r\u1ea5t quy\u1ebft \u0111o\u00e1n v\u00e0 nh\u1ea1y b\u00e9n trong cu\u1ed9c s\u1ed1ng, l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh, tr\u00ed tu\u1ec7 v\u00e0 r\u1ea5t c\u00f3 b\u1ea3n l\u0129nh", "sex": 3}
{"first_name": "Minh L\u00e2m", "meaning": "\"Minh\" l\u00e0 th\u00f4ng minh, L\u00e2m ch\u1ec9 t\u00ednh c\u00e1ch m\u1ea1nh m\u1ebd c\u1ee7a n\u00fai r\u1eebng. Minh L\u00e2m th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 c\u1ea3 t\u00e0i v\u00e0 s\u1ee9c, gi\u1ecfi giang.", "sex": 3}
{"first_name": "Nh\u00e3 L\u00e2m", "meaning": "\"Nh\u00e3\" \u00fd n\u00f3i s\u1ef1 nh\u00e3 nh\u1eb7n, nhu m\u00ec, nh\u1eb9 nh\u00e0ng m\u00e0 tinh t\u1ebf. Nh\u00e3 L\u00e2m, n\u00f3i v\u1ec1 m\u1ed9t ng\u01b0\u1eddi con g\u00e1i, t\u00e0i s\u1eafc v\u1eb9n to\u00e0n, ph\u1ea9m h\u1ea1nh \u0111oan trang, thu\u1ea7n khi\u1ebft b\u00ean trong, t\u00e2m h\u1ed3n cao th\u01b0\u1ee3ng", "sex": 5}
{"first_name": "Nh\u1eadt L\u00e2m", "meaning": "\"Nh\u1eadt\" ngh\u0129a l\u00e0 ban ng\u00e0y h\u00e0m \u00fd l\u00e0 s\u1ef1 chi\u1ebfu s\u00e1ng, v\u1ea7ng h\u00e0o quang r\u1ef1c r\u1ee1. Nh\u1eadt L\u00e2m, \u00fd n\u00f3i m\u1ed9t ng\u01b0\u1eddi lu\u00f4n bi\u1ebft t\u01b0 duy, th\u00e0nh c\u00f4ng trong c\u00f4ng vi\u1ec7c, cu\u1ed9c s\u1ed1ng.", "sex": 3}
{"first_name": "Nh\u01b0 L\u00e2m", "meaning": "\"Nh\u01b0\" c\u00f3 \u00fd ngh\u0129a l\u00e0 s\u1ef1 c\u00e2n \u0111\u1ed1i, c\u00e2n b\u1eb1ng, ho\u00e0n h\u1ea3o, t\u01b0\u01a1ng x\u1ee9ng. Nh\u01b0 L\u00e2m, ch\u1ec9 s\u1ef1 l\u1edbn m\u1ea1nh, \u0111i l\u00ean m\u1ed9t c\u00e1ch ho\u00e0n h\u1ea3o, th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 ch\u00ed h\u01b0\u1edbng c\u1ea7u ti\u1ebfn, ti\u1ebfn b\u1ed9, \u0111a n\u0103ng", "sex": 5}
{"first_name": "Ninh L\u00e2m", "meaning": "\"Ninh\" \u00fd n\u00f3i s\u1ef1 tr\u1eadt t\u1ef1, ch\u1eefng ch\u1ea1c, c\u00f3 \u0111\u1ed9 tin c\u1eady cao. Ninh L\u00e2m, \u00fd n\u00f3i ng\u01b0\u1eddi con trai c\u00f3 s\u1ee9c v\u00f3c, c\u00f3 th\u1ec3 bao b\u1ecdc, ch\u1edf che, tin t\u01b0\u1edfng tuy\u1ec7t \u0111\u1ed1i, t\u1ea1o s\u1ef1 an t\u00e2m, ch\u1eafc ch\u1eafn, s\u1ebd l\u00e0 tr\u1ee5 c\u1ed9t trong gia \u0111\u00ecnh, v\u00e0 gi\u1eef ch\u1ee9c v\u1ee5 quan trong tr\u1ecdng x\u00e3 h\u1ed9i.", "sex": 3}
{"first_name": "Ph\u00fa L\u00e2m", "meaning": "Ph\u00fa l\u00e0 gi\u00e0u sang. Ph\u00fa L\u00e2m ng\u1ee5 \u00fd ch\u1ec9 con ng\u01b0\u1eddi gi\u00e0u sang, may m\u1eafn.", "sex": 3}
