{"first_name": "Thanh L\u00e2m", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"L\u00e2m\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 n\u01a1i t\u1ee5 h\u1ecdp c\u1ee7a s\u1ed1 \u0111\u00f4ng, \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 trong s\u1ea1ch, li\u00eam khi\u1ebft. T\u00ean \"Thanh L\u00e2m\" \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi h\u1ed9i t\u1ee5 c\u00e1c \u0111\u1ee9c t\u00ednh cao qu\u00fd, trong s\u1ea1ch, li\u00eam khi\u1ebft c\u1ee7a b\u1eadc hi\u1ec1n nh\u00e2n", "sex": 7}
