{"first_name": "Tr\u00ed L\u00e2m", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"L\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 r\u1eebng, m\u1ed9t ngu\u1ed3n t\u00e0i nguy\u00ean qu\u00fd c\u00f3 gi\u00e1 tr\u1ecb to l\u1edbn v\u1edbi \u0111\u1eddi s\u1ed1ng. \"Tr\u00ed\" l\u00e0 tr\u00ed kh\u00f4n, tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft. T\u00ean \" Tr\u00ed L\u00e2m\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi th\u00f4ng minh, tr\u00ed tu\u1ec7, b\u00ecnh d\u1ecb, d\u1ec5 g\u1ea7n nh\u01b0 l\u1ebd t\u1ef1 nhi\u00ean nh\u01b0ng c\u0169ng m\u1ea1nh m\u1ebd & \u0111\u1ea7y uy l\u1ef1c", "sex": 3}
