{"first_name": "Duy\u00ean Qu\u00fd", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Qu\u00fd\" c\u00f3 ngh\u0129a l\u00e0 ph\u00fa qu\u00fd, gi\u00e0u sang, sung t\u00fac. v\u00e0 c\u0169ng c\u00f3 ngh\u0129a l\u00e0 \u0111i\u1ec1u qu\u00fd gi\u00e1.\"Duy\u00ean\"ngh\u0129a l\u00e0 s\u1ef1 h\u00e0i ho\u00e0 c\u1ee7a m\u1ed9t s\u1ed1 n\u00e9t t\u1ebf nh\u1ecb \u0111\u00e1ng y\u00eau t\u1ea1o n\u00ean v\u1ebb h\u1ea5p d\u1eabn t\u1ef1 nhi\u00ean c\u1ee7a ng\u01b0\u1eddi con g\u00e1i.\"Qu\u00fd Duy\u00ean\" mong mu\u1ed1n con xinh \u0111\u1eb9p duy\u00ean d\u00e1ng v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng gi\u00e0u sang,ph\u00fa qu\u00fd.", "sex": 5}
{"first_name": "Gi\u00e0u Qu\u00fd", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Qu\u00fd\" c\u00f3 th\u1ec3 hi\u1ec3u l\u00e0 \u0111\u1ecba v\u1ecb cao \u0111\u01b0\u1ee3c coi tr\u1ecdng, \u01b0u vi\u1ec7t, l\u00e0 s\u1ef1 qu\u00fd tr\u1ecdng, coi tr\u1ecdng. Ngo\u00e0i ra, \"Qu\u00fd\" c\u00f2n d\u00f9ng \u0111\u1ec3 t\u1ecf \u00fd t\u00f4n k\u00ednh \u0111\u1ed1i v\u1edbi nh\u1eefng ng\u01b0\u1eddi c\u00f3 t\u00e0i c\u00f3 \u0111\u1ee9c. \"Qu\u00fd Gi\u00e0u\" th\u1ec3 hi\u1ec7n s\u1ef1 mong mu\u1ed1n gi\u00e0u sang, ph\u00fa qu\u00fd trong t\u01b0\u01a1ng lai.", "sex": 3}
{"first_name": "Nam Qu\u00fd", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Qu\u00fd \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n v\u1ec1 m\u1ed9t cu\u1ed9c s\u1ed1ng \u0111\u1ea7y vinh hoa ph\u00fa qu\u00fd, g\u1eb7p nhi\u1ec1u may m\u1eafn, thu\u1eadn l\u1ee3i", "sex": 3}
{"first_name": "Ph\u00fa Qu\u00fd", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ph\u00fa\" c\u00f3 ngh\u0129a l\u00e0 gi\u00e0u c\u00f3, d\u1ed3i d\u00e0o, tr\u00e1ng th\u1ecbnh, \"Qu\u00fd\" c\u00f3 ngh\u0129a l\u00e0 sang tr\u1ecdng, qu\u00fd ph\u00e1i. \"Ph\u00fa Qu\u00fd\" th\u1ec3 hi\u1ec7n s\u1ef1 gi\u00e0u c\u00f3 v\u00e0 sang tr\u1ecdng. T\u1ef1a nh\u01b0 \u00fd ngh\u0129a c\u1ee7a c\u00e1i t\u00ean, nh\u1eefng ng\u01b0\u1eddi t\u00ean \"Ph\u00fa Qu\u00fd\" th\u01b0\u1eddng c\u00f3 c\u1ed1t c\u00e1ch cao sang, qu\u00fd ph\u00e1i, cu\u1ed9c s\u1ed1ng sung t\u00fac, gi\u00e0u c\u00f3.", "sex": 3}
{"first_name": "Thanh Qu\u00fd", "meaning": "\"Thanh Qu\u1ef3nh\" c\u00f3 ngh\u0129a l\u00e0 hoa qu\u1ef3nh v\u1eabn c\u00f2n t\u01b0\u01a1i, hay m\u1edbi ch\u1edbm n\u1edf. T\u00ean \"Thanh Qu\u1ef3nh\" l\u00e0 mong mu\u1ed1n con \u0111\u01b0\u1ee3c xinh \u0111\u1eb9p, qu\u00fd ph\u00e1i, kh\u1ecfe m\u1ea1nh v\u00e0 \u0111\u01b0\u1ee3c y\u00eau th\u01b0\u01a1ng, chi\u1ec1u chu\u1ed9ng", "sex": 5}
{"first_name": "V\u0129nh Qu\u00fd", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"V\u0129nh\" c\u00f3 ngh\u0129a l\u00e0 l\u00e2u d\u00e0i, m\u00e3i m\u00e3i, \"Qu\u00fd\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ecba v\u1ecb cao, \u01b0u vi\u1ec7t, l\u00e0 s\u1ef1 qu\u00fd tr\u1ecdng, coi tr\u1ecdng. T\u00ean \"V\u0129nh Qu\u00fd\" th\u1ec3 hi\u1ec7n mong mu\u1ed1n m\u1ecdi gi\u00e0u sang, ph\u00fa qu\u00fd, vinh hoa s\u1ebd b\u00ean c\u1ea1nh con su\u1ed1t cu\u1ed9c \u0111\u1eddi.", "sex": 3}
{"first_name": "B\u1ea3o Quan", "meaning": "\"B\u1ea3o\" l\u00e0 qu\u00fd gi\u00e1. \"B\u1ea3o Quan\" ch\u1ec9 ng\u01b0\u1eddi con trai c\u00f3 t\u1ea7m nh\u00ecn s\u00e1ng su\u1ed1t, h\u00e0nh x\u1eed kh\u00f4n ngoan.", "sex": 3}
{"first_name": "Thi\u00ean Quan", "meaning": "\"Thi\u00ean\" l\u00e0 ng\u00e0n. \"Thi\u00ean Quan\" l\u00e0 t\u1ea7m nh\u00ecn xa v\u1ee3i, ch\u1ec9 ng\u01b0\u1eddi con trai c\u00f3 ki\u1ebfn th\u1ee9c cao xa, hi\u1ec3u bi\u1ebft h\u01a1n ng\u01b0\u1eddi.", "sex": 3}
{"first_name": "C\u00f4ng S\u00e1ch", "meaning": "\"C\u00f4ng S\u00e1ch\" c\u00f3 ngh\u0129a l\u00e0 trang s\u00e1ch chung, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi c\u00f4ng t\u00e2m minh b\u1ea1ch, h\u00e0nh \u0111\u1ed9ng c\u00f4ng ch\u00ednh.", "sex": 3}
