{"first_name": "Xu\u00e2n S\u1eafc", "meaning": "\"Xu\u00e2n S\u1eafc\" ngh\u0129a l\u00e0 d\u00e1ng m\u1ea1o m\u00f9a xu\u00e2n, ch\u1ec9 v\u00e0o con ng\u01b0\u1eddi t\u01b0\u01a1i t\u1eafn \u0111\u1eb9p \u0111\u1ebd, l\u1ea1c quan an l\u00e0nh.", "sex": 5}
{"first_name": "Di\u1ec7p Sa", "meaning": "Theo ti\u1ebfng H\u00e1n- Vi\u1ec7t l\u00e0 ch\u1eef \"Di\u1ec7p\" ch\u00ednh l\u00e0 \"l\u00e1\" trong Kim Chi Ng\u1ecdc Di\u1ec7p (d\u1ecbch l\u00e0 c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc). V\u00ec v\u1eady, \u0111\u1eb7t t\u00ean Di\u1ec7p Sa cho con ng\u1ee5  \u00fd mu\u1ed1n n\u00f3i con nh\u00e0 quy\u1ec1n qu\u00fd sang gi\u00e0u, d\u00f2ng d\u00f5i danh gi\u00e1. B\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n th\u1ec3 hi\u1ec7n mong mu\u1ed1n t\u1ed1t \u0111\u1eb9p c\u1ee7a b\u1ed1 m\u1eb9 \u0111\u1ec3 con m\u00ecnh lu\u00f4n ki\u00eau sa, qu\u00fd ph\u00e1i khi \u0111\u01b0\u1ee3c \u0111\u1eb7t t\u00ean n\u00e0y.", "sex": 5}
{"first_name": "H\u1ea3i Sa", "meaning": "Theo ngh\u0129a H\u00e1n, \"h\u1ea3i\" c\u00f3 ngh\u0129a l\u00e0 bi\u1ec3n, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la, th\u01b0\u1eddng g\u1ee3i h\u00ecnh \u1ea3nh m\u00eanh m\u00f4ng c\u1ee7a bi\u1ec3n c\u1ea3, m\u1ed9t c\u1ea3nh thi\u00ean nhi\u00ean kh\u00e1 quen thu\u1ed9c v\u1edbi cu\u1ed9c s\u1ed1ng con ng\u01b0\u1eddi. T\u00ean \"H\u1ea3i Sa\" c\u0169ng th\u1ec3 hi\u1ec7n s\u1ef1 kho\u00e1ng \u0111\u1ea1t, t\u1ef1 do, t\u1ea5m l\u00f2ng r\u1ed9ng m\u1edf nh\u01b0 h\u00ecnh \u1ea3nh c\u1ee7a bi\u1ec3n kh\u01a1i", "sex": 7}
{"first_name": "Ki\u1ec1u Sa", "meaning": "Theo ti\u1ebfng H\u00e1n, t\u00ean \"Ki\u1ec1u\" mang \u00fd ngh\u0129a l\u00e0 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, c\u00f3 nhan s\u1eafc rung \u0111\u1ed9ng l\u00f2ng ng\u01b0\u1eddi n\u00ean th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con g\u00e1i v\u1edbi mong mu\u1ed1n c\u00e1c b\u00e9 g\u00e1i khi l\u1edbn l\u00ean s\u1ebd c\u00f3 \u0111\u01b0\u1ee3c dung m\u1ea1o xinh x\u1eafn, duy\u00ean d\u00e1ng v\u00e0 t\u1ea1o \u1ea5n t\u01b0\u1ee3ng v\u1edbi m\u1ecdi ng\u01b0\u1eddi. T\u00ean \"Ki\u1ec1u\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho c\u00e1c ti\u1ec3u th\u01b0 khu\u00ea c\u00e1c, v\u1ed1n l\u00e0 nh\u1eefng c\u00f4 g\u00e1i th\u00f4ng minh, t\u00e0i s\u1eafc v\u1eb9n to\u00e0n.", "sex": 5}
{"first_name": "Linh Sa", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Linh\" c\u00f3 ngh\u0129a l\u00e0 c\u00e1i chu\u00f4ng nh\u1ecf \u0111\u00e1ng y\u00eau, ngo\u00e0i ra \"Linh\" c\u00f2n l\u00e0 t\u1eeb \u0111\u1ec3 ch\u1ec9 tinh th\u1ea7n con ng\u01b0\u1eddi, tin t\u01b0\u1edfng v\u00e0o nh\u1eefng \u0111i\u1ec1u k\u00ec di\u1ec7u, th\u1ea7n k\u00ec ch\u01b0a l\u00fd gi\u1ea3i \u0111\u01b0\u1ee3c. V\u1ec1 t\u00ednh c\u00e1ch, trong ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Linh\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u1eb9n, th\u00f4ng minh. T\u00ean \"Linh Sa\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi h\u00e0m \u00fd t\u1ed1t l\u00e0nh, th\u1ec3 hi\u1ec7n s\u1ef1 \u1ee9ng nghi\u1ec7m m\u00e0u nhi\u1ec7m c\u1ee7a nh\u1eefng \u0111i\u1ec1u th\u1ea7n k\u00ec, ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi dung m\u1ea1o \u0111\u00e1ng y\u00eau, t\u00e0i hoa, tinh anh, nhanh nh\u1eb9n, th\u00f4ng minh & lu\u00f4n g\u1eb7p may m\u1eafn, \u0111\u01b0\u1ee3c che ch\u1edf, gi\u00fap \u0111\u1ee1 trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
{"first_name": "Minh Sa", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, Minh c\u00f2n c\u00f3 ngh\u0129a ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (b\u00ecnh minh) th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. T\u00ean H\u1ea3i sa \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd th\u00f4ng minh, tr\u00ed tu\u1ec7, ngo\u1ea1i h\u00ecnh thanh t\u00fa, \u0111\u01b0\u1ee3c y\u00eau th\u01b0\u01a1ng, qu\u00fd m\u1ebfn", "sex": 7}
{"first_name": "Nam Sa", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Sa l\u00e0 mong mu\u1ed1n con \u0111\u01b0\u1ee3c xinh \u0111\u1eb9p, duy\u00ean d\u00e1ng, \u0103n n\u00f3i nh\u1ecf nh\u1eb9, hi\u1ec1n l\u00e0nh", "sex": 7}
{"first_name": "Ng\u1ecdc Sa", "meaning": "\"Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh,... th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed. T\u00ean Ng\u1ecdc Sa th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u1ecfa s\u00e1ng, duy\u00ean d\u00e1ng, d\u1ecbu d\u00e0ng, \u0103n n\u00f3i nh\u1ecf nh\u1eb9, n\u1ebft na, mong manh r\u1ea5t \u0111\u00e1ng y\u00eau, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi n\u00e2ng niu, y\u00eau th\u01b0\u01a1ng", "sex": 5}
{"first_name": "Qu\u1ef3nh Sa", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"qu\u1ef3nh\" l\u00e0 m\u1ed9t vi\u00ean ng\u1ecdc \u0111\u1eb9p v\u00e0 thanh t\u00fa. Ngo\u00e0i ra \"Qu\u1ef3nh\" c\u00f2n l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa lu\u00f4n n\u1edf ng\u00e1t h\u01b0\u01a1ng v\u00e0o ban \u0111\u00eam. T\u00ean \"Qu\u1ef3nh Sa\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi thanh t\u00fa, d\u1ecbu d\u00e0ng, duy\u00ean d\u00e1ng, dung m\u1ea1o xinh \u0111\u1eb9p, b\u1ea3n t\u00ednh khi\u00eam nh\u01b0\u1eddng, thanh cao", "sex": 5}
{"first_name": "Th\u00fay Sa", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn vi\u00ean ng\u1ecdc \u0111\u1eb9p, ng\u1ecdc qu\u00fd.  \"Th\u00fay Sa\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd lu\u00f4n xinh \u0111\u1eb9p, quy\u1ec1n qu\u00fd, d\u1ecbu d\u00e0ng, duy\u00ean d\u00e1ng, \u0111\u01b0\u1ee3c tr\u00e2n tr\u1ecdng v\u00e0 n\u00e2ng niu", "sex": 5}
