{"first_name": "\u00c1i Qu\u1ea3ng", "meaning": "Qu\u1ea3ng trong ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 qu\u1ea3ng \u0111\u1ea1i, bao qu\u00e1t. K\u1ebft h\u1ee3p v\u1edbi ch\u1eef \u00c1i c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. T\u00ean Qu\u1ea3ng \u00c1i ng\u1ee5 \u00fd ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng bao dung, r\u1ed9ng l\u01b0\u1ee3ng, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng", "sex": 3}
