{"first_name": "B\u00e1ch Quang", "meaning": "\"B\u00e1ch\" hay c\u00f2n g\u1ecdi l\u00e0 t\u00f9ng, l\u00e0 th\u00f4ng, mang \u00fd ngh\u0129a nhi\u1ec1u, to l\u1edbn, th\u00f4ng tu\u1ec7. \"Quang\" l\u00e0 to l\u1edbn, th\u1ecbnh \u0111\u1ea1i, l\u00e0 h\u00f9ng d\u0169ng, m\u1ea1nh b\u1ea1o v\u00e0 uy v\u0169 c\u00f3 ngh\u0129a l\u00e0 c\u1ee9ng c\u1ecfi, c\u01b0\u01a1ng tr\u1ef1c, qu\u1ea3 quy\u1ebft v\u00e0 trong l\u00f2ng th\u1eb3ng th\u1eafn, kh\u00f4ng m\u01b0u \u0111\u1ed3 m\u1edd \u00e1m. Quang c\u00f2n c\u00f3 ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u00e1ng s\u1ee7a, r\u1ef1c r\u1ee1, l\u00e0m cho s\u00e1ng t\u1ecf, l\u00e0m cho r\u1ea1ng r\u1ee1. \"B\u00e1ch Quang\" l\u00e0 m\u1ed9t ng\u01b0\u1eddi kh\u00f4ng t\u1ea7m th\u01b0\u1eddng, ng\u01b0\u1eddi c\u00f3 tr\u00e1i tim l\u1edbn v\u00e0 t\u01b0 t\u01b0\u1edfng l\u1edbn, m\u1ed9t ng\u01b0\u1eddi ch\u00ednh ngh\u0129a, c\u01b0\u01a1ng tr\u1ef1c, c\u00f3 t\u1ea5m l\u00f2ng ngay th\u1eb3ng v\u00e0 trong s\u00e1ng.", "sex": 3}
