{"first_name": "Minh Sang", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, Minh c\u00f2n c\u00f3 ngh\u0129a ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (b\u00ecnh minh) th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. T\u00ean Minh Sang \u0111\u01b0\u1ee3c \u0111\u1eb7t ng\u1ee5 \u00fd mong mu\u1ed1n con c\u00f3 \u0111\u01b0\u1ee3c tr\u00ed tu\u1ec7 s\u00e1ng su\u1ed1t, cu\u1ed9c s\u1ed1ng gi\u00e0u sang, vinh hoa, ph\u00fa qu\u00fd", "sex": 3}
{"first_name": "M\u1ef9 Sang", "meaning": "\"Sang\" \u0111\u01b0\u1ee3c \u0111\u1eb7c v\u1edbi \u01b0\u1edbc mong v\u1ec1 m\u1ed9t cu\u1ed9c s\u1ed1ng sung t\u00fac v\u1ec1 c\u1ea3 v\u1eadt ch\u1ea5t l\u1eabn tinh th\u1ea7n. Gi\u00e0u c\u00f3 v\u00e0 t\u00e0i \u0111\u1ee9c, \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi k\u00ednh n\u1ec3. M\u1ef9 l\u00e0 xinh \u0111\u1eb9p. Sang M\u1ef9 l\u00e0 c\u00e1i t\u00ean mong \u01b0\u1edbc v\u1ec1 m\u1ed9t ng\u01b0\u1eddi xinh \u0111\u1eb9p v\u00e0 sung t\u00fac trong t\u01b0\u01a1ng lai", "sex": 5}
{"first_name": "Nam Sang", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Sang l\u00e0 mong mu\u1ed1n l\u00e0 ng\u01b0\u1eddi c\u00f3 nh\u00e2n c\u00e1ch, ph\u1ea9m ch\u1ea5t t\u1ed1t \u0111\u1eb9p, c\u00f3 cu\u1ed9c s\u1ed1ng vinh hoa ph\u00fa qu\u00fd, \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi n\u1ec3 tr\u1ecdng", "sex": 3}
{"first_name": "Ng\u1ecdc Sang", "meaning": "\"Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh,... th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed. T\u00ean Ng\u1ecdc Sang th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, qu\u00fd ph\u00e1i, cu\u1ed9c s\u1ed1ng gi\u00e0u sang, danh l\u1ee3i ph\u1ed3n vinh, \u0111\u01b0\u1ee3c k\u00ednh n\u1ec3, t\u00f4n tr\u1ecdng", "sex": 3}
{"first_name": "Thanh Sang", "meaning": "\"Thanh Sang\" l\u00e0 c\u00e1i t\u00ean th\u01b0\u1eddng \u0111\u1eb7t cho c\u00e1c b\u00e9 trai nh\u1eb1m mong mu\u1ed1n con s\u1ebd c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng gi\u00e0u sang, sung t\u00fac, c\u00f3 c\u1ed1t c\u00e1ch cao sang, li\u00eam khi\u1ebft \u0111\u01b0\u1ee3c n\u1ec3 tr\u1ecdng, k\u00ednh y\u00eau", "sex": 3}
{"first_name": "Tr\u1ecdng Sang", "meaning": "\"Tr\u1ecdng\" l\u00e0 ng\u01b0\u1eddi bi\u1ebft qu\u00fd tr\u1ecdng l\u1ebd ph\u1ea3i, s\u1ed1ng \u0111\u1ea1o l\u00fd, \u0111\u1ee9ng \u0111\u1eafn, lu\u00f4n ch\u1ecdn con \u0111\u01b0\u1eddng ngay th\u1eb3ng. Ng\u01b0\u1eddi t\u00ean \"Tr\u1ecdng Sang\" th\u01b0\u1eddng c\u00f3 c\u1ed1t c\u00e1ch thanh cao, nghi\u00eam t\u00fac, s\u1ed1ng c\u00f3 \u0111\u1ea1o l\u00fd, c\u00f3 t\u00ecnh ngh\u0129a, \u0111\u01b0\u1ee3c k\u00ednh tr\u1ecdng, n\u1ec3 nang", "sex": 3}
{"first_name": "B\u1ea3o S\u00e2m", "meaning": "Ch\u1eef \"B\u1ea3o\" & ch\u1eef \"S\u00e2m\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t \u0111\u1ec1u g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. V\u00ec v\u1eady, t\u00ean \"B\u1ea3o S\u00e2m\"th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con nh\u01b0 h\u00e0m \u00fd con ch\u00ednh l\u00e0 b\u1ea3o v\u1eadt m\u00e0 b\u1ed1 m\u1eb9 lu\u00f4n n\u00e2ng niu, gi\u1eef g\u00ecn. B\u00ean c\u1ea1nh, t\u00ean \"B\u1ea3o S\u00e2m\" c\u00f2n \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 cu\u1ed9c s\u1ed1ng \u1ea5m \u00eam lu\u00f4n \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng", "sex": 3}
{"first_name": "H\u1ea3i S\u00e2m", "meaning": "Theo ngh\u0129a H\u00e1n, \"H\u1ea3i\" c\u00f3 ngh\u0129a l\u00e0 bi\u1ec3n, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. \"S\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ed3 qu\u00fd b\u00e1u, tr\u00e2n b\u1ea3o, ngo\u00e0i ra c\u00f2n l\u00e0 t\u00ean c\u1ee7a m\u1ed9t lo\u1ea1i c\u1ecf s\u00e2m, l\u00e1 nh\u01b0 c\u00e1i b\u00e0n tay, hoa nh\u1ecf m\u00e0 tr\u1eafng, d\u00f9ng l\u00e0m thu\u1ed1c. T\u00ean \"H\u1ea3i S\u00e2m\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u00e2m h\u1ed3n kho\u00e1ng \u0111\u1ea1t, c\u00f3 t\u00e0i n\u0103ng c\u00f3 th\u1ec3 gi\u00fap \u00edch cho ng\u01b0\u1eddi cho \u0111\u1eddi nh\u01b0 lo\u00e0i s\u00e2m qu\u00fd \u1ea5y. \u0110\u1eb7t con t\u00ean \"H\u1ea3i S\u00e2m\" l\u00e0 mong con c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng b\u00ecnh an, vinh hoa, ph\u00fa qu\u00fd", "sex": 3}
{"first_name": "H\u00f2a S\u00e2m", "meaning": "\"H\u00f2a\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 \u00eam \u1ea5m, y\u00ean \u1ed5n ch\u1ec9 s\u1ef1 thu\u1eadn h\u1ee3p. \"S\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ed3 qu\u00fd b\u00e1u, tr\u00e2n b\u1ea3o, ngo\u00e0i ra c\u00f2n l\u00e0 t\u00ean c\u1ee7a m\u1ed9t lo\u1ea1i c\u1ecf s\u00e2m, l\u00e1 nh\u01b0 c\u00e1i b\u00e0n tay, hoa nh\u1ecf m\u00e0 tr\u1eafng, d\u00f9ng l\u00e0m thu\u1ed1c. T\u00ean \"H\u00f2a S\u00e2m\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u00e0i n\u0103ng,   hi\u1ec1n l\u00e0nh, th\u00e1i \u0111\u1ed9 t\u1eeb t\u1ed1n, m\u1ec1m m\u1ecfng, ng\u00f4n ng\u1eef nh\u1ecf nh\u1eb9, \u00f4n h\u00f2a. \u0110\u1eb7t con t\u00ean \"H\u00f2a S\u00e2m\" l\u00e0 mong con c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng b\u00ecnh an, vinh hoa, ph\u00fa qu\u00fd", "sex": 3}
{"first_name": "Ho\u00e0ng S\u00e2m", "meaning": "\"Ho\u00e0ng\" trong ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 m\u00e0u v\u00e0ng, \u00e1nh s\u1eafc c\u1ee7a v\u00e0ng v\u00e0 \u1edf m\u1ed9t ngh\u0129a kh\u00e1c th\u00ec \"Ho\u00e0ng\" th\u1ec3 hi\u1ec7n s\u1ef1 nghi\u00eam trang, r\u1ef1c r\u1ee1,huy ho\u00e0ng nh\u01b0 b\u1eadc vua ch\u00faa. \"S\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ed3 qu\u00fd b\u00e1u, tr\u00e2n b\u1ea3o, ngo\u00e0i ra c\u00f2n l\u00e0 t\u00ean c\u1ee7a m\u1ed9t lo\u1ea1i c\u1ecf s\u00e2m, l\u00e1 nh\u01b0 c\u00e1i b\u00e0n tay, hoa nh\u1ecf m\u00e0 tr\u1eafng, d\u00f9ng l\u00e0m thu\u1ed1c. T\u00ean \"Ho\u00e0ng S\u00e2m\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u00e0i n\u0103ng, c\u1ed1t c\u00e1ch v\u01b0\u01a1ng gi\u1ea3, mong con c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng b\u00ecnh an, vinh hoa, ph\u00fa qu\u00fd", "sex": 3}
