{"first_name": "Linh S\u00e2m", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Linh\" c\u00f3 ngh\u0129a l\u00e0 c\u00e1i chu\u00f4ng nh\u1ecf \u0111\u00e1ng y\u00eau. V\u1ec1 t\u00ednh c\u00e1ch, \"Linh\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u1eb9n, th\u00f4ng minh. \"S\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ed3 qu\u00fd b\u00e1u, tr\u00e2n b\u1ea3o, ngo\u00e0i ra c\u00f2n l\u00e0 t\u00ean c\u1ee7a m\u1ed9t lo\u1ea1i c\u1ecf s\u00e2m, l\u00e1 nh\u01b0 c\u00e1i b\u00e0n tay, hoa nh\u1ecf m\u00e0 tr\u1eafng, d\u00f9ng l\u00e0m thu\u1ed1c. T\u00ean \"Linh S\u00e2m\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u00e0i n\u0103ng c\u00f3 th\u1ec3 gi\u00fap \u00edch cho ng\u01b0\u1eddi cho \u0111\u1eddi nh\u01b0 lo\u00e0i s\u00e2m qu\u00fd \u1ea5y. \u0110\u1eb7t con t\u00ean \"Linh S\u00e2m\" l\u00e0 mong con c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng b\u00ecnh an, vinh hoa, ph\u00fa qu\u00fd, lu\u00f4n g\u1eb7p may m\u1eafn, \u0111\u01b0\u1ee3c che ch\u1edf, gi\u00fap \u0111\u1ee1 trong cu\u1ed9c s\u1ed1ng.", "sex": 3}
{"first_name": "Minh S\u00e2m", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, Minh c\u00f2n c\u00f3 ngh\u0129a ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (b\u00ecnh minh) th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. \"S\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ed3 qu\u00fd b\u00e1u, tr\u00e2n b\u1ea3o, ngo\u00e0i ra c\u00f2n l\u00e0 t\u00ean c\u1ee7a m\u1ed9t lo\u1ea1i c\u1ecf s\u00e2m, l\u00e1 nh\u01b0 c\u00e1i b\u00e0n tay, hoa nh\u1ecf m\u00e0 tr\u1eafng, d\u00f9ng l\u00e0m thu\u1ed1c. T\u00ean \"Minh S\u00e2m\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7 th\u00f4ng minh, t\u00e0i n\u0103ng c\u00f3 th\u1ec3 gi\u00fap \u00edch cho ng\u01b0\u1eddi cho \u0111\u1eddi nh\u01b0 lo\u00e0i s\u00e2m qu\u00fd \u1ea5y. \u0110\u1eb7t con t\u00ean \"Minh S\u00e2m\" l\u00e0 mong con c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng b\u00ecnh an, vinh hoa, ph\u00fa qu\u00fd", "sex": 3}
{"first_name": "Ng\u1ecdc S\u00e2m", "meaning": "\"Ng\u1ecdc\" theo ti\u1ebfng H\u00e1n vi\u1ec7t l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh,... th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed. \"S\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ed3 qu\u00fd b\u00e1u, tr\u00e2n b\u1ea3o, ngo\u00e0i ra c\u00f2n l\u00e0 t\u00ean c\u1ee7a m\u1ed9t lo\u1ea1i c\u1ecf s\u00e2m, l\u00e1 nh\u01b0 c\u00e1i b\u00e0n tay, hoa nh\u1ecf m\u00e0 tr\u1eafng, d\u00f9ng l\u00e0m thu\u1ed1c. T\u00ean \"Ng\u1ecdc S\u00e2m\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u00e0i n\u0103ng c\u00f3 th\u1ec3 gi\u00fap \u00edch cho ng\u01b0\u1eddi cho \u0111\u1eddi nh\u01b0 lo\u00e0i s\u00e2m qu\u00fd \u1ea5y. \u0110\u1eb7t con t\u00ean \"Ng\u1ecdc S\u00e2m\" th\u1ec3 hi\u1ec7n s\u1ef1 y\u00eau th\u01b0\u01a1ng, tr\u00e2n qu\u00fd c\u1ee7a cha m\u1eb9 \u0111\u1ed1i v\u1edbi con, v\u00e0 mong con c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng b\u00ecnh an, vinh hoa, ph\u00fa qu\u00fd", "sex": 3}
{"first_name": "Nh\u00e2n S\u00e2m", "meaning": "Nh\u00e2n trong ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ng\u01b0\u1eddi, thi\u00ean ch\u1ec9 v\u1ec1 ph\u1ea7n t\u00ednh c\u00e1ch v\u00ec Nh\u00e2n c\u00f2n c\u00f3 ngh\u0129a l\u00e0 ph\u1ea7n gi\u00e1 tr\u1ecb c\u1ed1t l\u00f5i b\u00ean trong. \"S\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ed3 qu\u00fd b\u00e1u, tr\u00e2n b\u1ea3o, ngo\u00e0i ra c\u00f2n l\u00e0 t\u00ean c\u1ee7a m\u1ed9t lo\u1ea1i c\u1ecf s\u00e2m, l\u00e1 nh\u01b0 c\u00e1i b\u00e0n tay, hoa nh\u1ecf m\u00e0 tr\u1eafng, d\u00f9ng l\u00e0m thu\u1ed1c. \"Nh\u00e2n S\u00e2m\" c\u00f2n hay \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 g\u1ecdi t\u00ean m\u1ed9t lo\u00e0i thu\u1ed1c b\u1ed5, qu\u00fd hi\u1ebfm. T\u00ean \"Nh\u00e2n S\u00e2m\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi cao sang, c\u00f3 t\u00e0i n\u0103ng c\u00f3 th\u1ec3 gi\u00fap \u00edch cho ng\u01b0\u1eddi cho \u0111\u1eddi nh\u01b0 lo\u00e0i s\u00e2m qu\u00fd \u1ea5y. \u0110\u1eb7t con t\u00ean \"Nh\u00e2n S\u00e2m\" l\u00e0 mong con c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng b\u00ecnh an, vinh hoa, ph\u00fa qu\u00fd", "sex": 3}
{"first_name": "Ph\u01b0\u1edbc S\u00e2m", "meaning": "Ch\u1eef \"Ph\u01b0\u1edbc\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t c\u00f3 hai ngh\u0129a ch\u00ednh nh\u01b0 sau: m\u1ed9t l\u00e0 h\u00ean, may m\u1eafn, hai l\u00e0 \u0111i\u00ea\u0300u t\u00f4\u0301t la\u0300nh do Tr\u01a1\u0300i Ph\u00e2\u0323t ban cho ng\u01b0\u01a1\u0300i t\u01b0\u0300ng la\u0300m nhi\u00ea\u0300u vi\u00ea\u0323c nh\u00e2n \u0111\u01b0\u0301c. T\u00ean \"Ph\u01b0\u1edbc\" d\u00f9ng \u0111\u1ec3 th\u1ec3 hi\u1ec7n m\u1ed9t con ng\u01b0\u1eddi t\u1ed1t, nh\u00e2n \u0111\u1ee9c n\u00ean lu\u00f4n g\u1eb7p \u0111\u01b0\u1ee3c nh\u1eefng may m\u1eafn, t\u1ed1t l\u00e0nh. Cu\u1ed9c s\u1ed1ng c\u1ee7a h\u1ecd c\u00f3 v\u1ebb an nh\u00e0n v\u00e0 lu\u00f4n l\u00e0m \u0111i\u1ec1u t\u1ed1t. \"S\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ed3 qu\u00fd b\u00e1u, tr\u00e2n b\u1ea3o, ngo\u00e0i ra c\u00f2n l\u00e0 t\u00ean c\u1ee7a m\u1ed9t lo\u1ea1i c\u1ecf s\u00e2m, l\u00e1 nh\u01b0 c\u00e1i b\u00e0n tay, hoa nh\u1ecf m\u00e0 tr\u1eafng, d\u00f9ng l\u00e0m thu\u1ed1c. T\u00ean \"Ph\u01b0\u1edbc S\u00e2m\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u00e0i n\u0103ng c\u00f3 th\u1ec3 gi\u00fap \u00edch cho ng\u01b0\u1eddi cho \u0111\u1eddi nh\u01b0 lo\u00e0i s\u00e2m qu\u00fd \u1ea5y. \u0110\u1eb7t t\u00ean  \"Ph\u01b0\u1edbc S\u00e2m\"  l\u00e0 mong mu\u1ed1n c\u1ee7a cha m\u1eb9 mong mu\u1ed1n con m\u00ecnh l\u00e0 ng\u01b0\u1eddi t\u1ed1t, nh\u00e2n h\u1eadu v\u00e0 hi\u1ec1n l\u00e0nh", "sex": 3}
