{"first_name": "Tr\u1ecdng S\u00e2m", "meaning": "\"Tr\u1ecdng\" l\u00e0 ng\u01b0\u1eddi bi\u1ebft qu\u00fd tr\u1ecdng l\u1ebd ph\u1ea3i, s\u1ed1ng \u0111\u1ea1o l\u00fd, \u0111\u1ee9ng \u0111\u1eafn, lu\u00f4n ch\u1ecdn con \u0111\u01b0\u1eddng ngay th\u1eb3ng. Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"S\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ed3 qu\u00fd b\u00e1u, tr\u00e2n b\u1ea3o, ngo\u00e0i ra c\u00f2n l\u00e0 t\u00ean c\u1ee7a m\u1ed9t lo\u1ea1i c\u1ecf s\u00e2m, l\u00e1 nh\u01b0 c\u00e1i b\u00e0n tay, hoa nh\u1ecf m\u00e0 tr\u1eafng, d\u00f9ng l\u00e0m thu\u1ed1c. T\u00ean \"Tr\u1ecdng S\u00e2m\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u00e0i n\u0103ng c\u00f3 th\u1ec3 gi\u00fap \u00edch cho ng\u01b0\u1eddi cho \u0111\u1eddi nh\u01b0 lo\u00e0i s\u00e2m qu\u00fd \u1ea5y. \u0110\u1eb7t con t\u00ean \"Tr\u1ecdng S\u00e2m\" l\u00e0 mong con c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng b\u00ecnh an, vinh hoa, ph\u00fa qu\u00fd, c\u00f3 c\u1ed1t c\u00e1ch thanh cao, nghi\u00eam t\u00fac, s\u1ed1ng c\u00f3 \u0111\u1ea1o l\u00fd, c\u00f3 t\u00ecnh ngh\u0129a", "sex": 3}
{"first_name": "Tr\u01b0\u1eddng S\u00e2m", "meaning": "Theo t\u1eeb \u0111i\u1ec3n Ti\u1ebfng Vi\u1ec7t, \"Tr\u01b0\u1eddng\" c\u00f3 ngh\u0129a l\u00e0 d\u00e0i, l\u00e2u, xa. \"Tr\u01b0\u1eddng\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd c\u00f3 \u00fd ch\u00ed ki\u00ean c\u01b0\u1eddng, c\u00f3 l\u1eadp tr\u01b0\u1eddng b\u1ec1n v\u1eefng, d\u00f9 c\u00f3 kh\u00f3 kh\u0103n hay v\u1ea5p ng\u00e3 c\u0169ng c\u00f3 th\u1ec3 \u0111\u1ee9ng v\u1eefng. Ngo\u00e0i ra, c\u00f2n c\u00f3 \u00fd ngh\u0129a mong con s\u1ebd m\u1ea1nh kh\u1ecfe v\u00e0 s\u1ed1ng l\u00e2u. Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"S\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ed3 qu\u00fd b\u00e1u, tr\u00e2n b\u1ea3o, ngo\u00e0i ra c\u00f2n l\u00e0 t\u00ean c\u1ee7a m\u1ed9t lo\u1ea1i c\u1ecf s\u00e2m, l\u00e1 nh\u01b0 c\u00e1i b\u00e0n tay, hoa nh\u1ecf m\u00e0 tr\u1eafng, d\u00f9ng l\u00e0m thu\u1ed1c. T\u00ean \"Tr\u01b0\u1eddng S\u00e2m\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u00e0i n\u0103ng c\u00f3 th\u1ec3 gi\u00fap \u00edch cho ng\u01b0\u1eddi cho \u0111\u1eddi, c\u00f3 kh\u00ed ch\u1ea5t m\u1ea1nh m\u1ebd, ki\u00ean c\u01b0\u1eddng", "sex": 3}
{"first_name": "Di San", "meaning": "\"Di\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0  vui v\u1ebb, sung s\u01b0\u1edbng. \"San\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn san h\u00f4, m\u1ed9t th\u1ee9 \u0111\u1ed9ng v\u1eadt nh\u1ecf \u1edf trong b\u1ec3 k\u1ebft tinh, h\u00ecnh nh\u01b0 c\u00e0nh c\u00e2y, \u0111\u1eb9p nh\u01b0 ng\u1ecdc, d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c.  T\u00ean \"Di San\" g\u1ee3i l\u00ean h\u00ecnh \u1ea3nh xinh \u0111\u1eb9p, long lanh nh\u01b0ng th\u1eadt r\u1eafn ch\u1eafc. \u0110\u1eb7t t\u00ean n\u00e0y l\u00e0 mong con s\u1ebd lu\u00f4n xinh \u0111\u1eb9p, cao sang, c\u00f3 b\u1ea3n l\u0129nh, \u0111\u1ea7y s\u1ee9c s\u1ed1ng \u0111\u1ec3 v\u01b0\u1ee3t qua m\u1ecdi kh\u00f3 kh\u0103n trong cu\u1ed9c \u0111\u1eddi, b\u1ed1 m\u1eb9 hi v\u1ecdng cu\u1ed9c s\u1ed1ng c\u1ee7a con lu\u00f4n \u0111\u1ea7y \u1eafp ni\u1ec1m vui v\u00e0 ti\u1ebfng c\u01b0\u1eddi", "sex": 5}
{"first_name": "Di\u1ec5m San", "meaning": "\"Di\u1ec5m\" theo ti\u1ebfng h\u00e1n - vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u1ed1t \u0111\u1eb9p, v\u1ebb t\u01b0\u01a1i s\u00e1ng, xinh \u0111\u1eb9p l\u1ed9ng l\u1eaby th\u01b0\u1eddng ng\u1ee5 \u00fd ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p, y\u1ec3u \u0111i\u1ec7u. \"San\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn san h\u00f4, m\u1ed9t th\u1ee9 \u0111\u1ed9ng v\u1eadt nh\u1ecf \u1edf trong b\u1ec3 k\u1ebft tinh, h\u00ecnh nh\u01b0 c\u00e0nh c\u00e2y, \u0111\u1eb9p nh\u01b0 ng\u1ecdc, d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c. T\u00ean \"Di\u1ec5m San\" g\u1ee3i l\u00ean h\u00ecnh \u1ea3nh xinh \u0111\u1eb9p, l\u1ed9ng l\u1eaby, long lanh nh\u01b0ng th\u1eadt r\u1eafn ch\u1eafc. \u0110\u1eb7t t\u00ean n\u00e0y l\u00e0 mong con s\u1ebd lu\u00f4n xinh \u0111\u1eb9p, cao sang, c\u00f3 b\u1ea3n l\u0129nh, \u0111\u1ea7y s\u1ee9c s\u1ed1ng \u0111\u1ec3 v\u01b0\u1ee3t qua m\u1ecdi kh\u00f3 kh\u0103n trong cu\u1ed9c \u0111\u1eddi", "sex": 5}
{"first_name": "Di\u1ec7p San", "meaning": "Theo ti\u1ebfng H\u00e1n- Vi\u1ec7t l\u00e0 ch\u1eef \"Di\u1ec7p\" ch\u00ednh l\u00e0 \"l\u00e1\" trong Kim Chi Ng\u1ecdc Di\u1ec7p (d\u1ecbch l\u00e0 c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc). Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"San\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn san h\u00f4, m\u1ed9t th\u1ee9 \u0111\u1ed9ng v\u1eadt nh\u1ecf \u1edf trong b\u1ec3 k\u1ebft tinh, h\u00ecnh nh\u01b0 c\u00e0nh c\u00e2y, \u0111\u1eb9p nh\u01b0 ng\u1ecdc, d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c. T\u00ean \"San\" g\u1ee3i l\u00ean h\u00ecnh \u1ea3nh xinh \u0111\u1eb9p, v\u1eeba m\u1ec1m m\u1ea1i nh\u01b0 l\u00e1 v\u1eeba c\u1ee9ng r\u1eafn nh\u01b0 san h\u00f4. \u0110\u1eb7t t\u00ean n\u00e0y l\u00e0 mong con s\u1ebd lu\u00f4n xinh \u0111\u1eb9p, cao sang, c\u00f3 b\u1ea3n l\u0129nh, \u0111\u1ea7y s\u1ee9c s\u1ed1ng \u0111\u1ec3 v\u01b0\u1ee3t qua m\u1ecdi kh\u00f3 kh\u0103n trong cu\u1ed9c \u0111\u1eddi", "sex": 5}
{"first_name": "H\u1ea3i San", "meaning": "Theo ngh\u0129a H\u00e1n, \"H\u1ea3i\" c\u00f3 ngh\u0129a l\u00e0 bi\u1ec3n, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. \"San\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn san h\u00f4, m\u1ed9t th\u1ee9 \u0111\u1ed9ng v\u1eadt nh\u1ecf \u1edf trong b\u1ec3 k\u1ebft tinh, h\u00ecnh nh\u01b0 c\u00e0nh c\u00e2y, \u0111\u1eb9p nh\u01b0 ng\u1ecdc, d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c. T\u00ean \"H\u1ea3i San\" g\u1ee3i l\u00ean h\u00ecnh \u1ea3nh xinh \u0111\u1eb9p, long lanh c\u1ee7a lo\u00e0i san h\u00f4 \u1edf bi\u1ec3n th\u1eadt r\u1eafn ch\u1eafc nh\u01b0ng c\u0169ng m\u1ec1m m\u1ea1i. \u0110\u1eb7t t\u00ean n\u00e0y l\u00e0 mong con s\u1ebd lu\u00f4n xinh \u0111\u1eb9p, cao sang, c\u00f3 b\u1ea3n l\u0129nh, \u0111\u1ea7y s\u1ee9c s\u1ed1ng \u0111\u1ec3 v\u01b0\u1ee3t qua m\u1ecdi kh\u00f3 kh\u0103n trong cu\u1ed9c \u0111\u1eddi", "sex": 5}
