{"first_name": "Nam San", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam San th\u1ec3 hi\u1ec7n s\u1ef1 b\u1ea3n l\u0129nh, kh\u00f4ng ng\u1ea1i gian kh\u00f3, kh\u00f4ng s\u1ee3 v\u1ea5p ng\u00e3. Cha m\u1eb9 mong con lu\u00f4n m\u1ea1nh m\u1ebd \u0111\u1ec3 v\u01b0\u1ee3t qua kh\u00f3 kh\u0103n h\u01b0\u1edbng t\u1edbi vinh quang", "sex": 5}
{"first_name": "Ng\u00e2n San", "meaning": "Ng\u00e2n theo ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ti\u1ec1n. Th\u1ec3 hi\u1ec7n s\u1ef1 qu\u00fd b\u00e1u. \"San\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn san h\u00f4, m\u1ed9t th\u1ee9 \u0111\u1ed9ng v\u1eadt nh\u1ecf \u1edf trong b\u1ec3 k\u1ebft tinh, h\u00ecnh nh\u01b0 c\u00e0nh c\u00e2y, \u0111\u1eb9p nh\u01b0 ng\u1ecdc, d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c. T\u00ean \"San Ng\u00e2n\" g\u1ee3i l\u00ean h\u00ecnh \u1ea3nh nh\u1eefng lo\u00e0i san h\u00f4 qu\u00fd b\u00e1u, xinh \u0111\u1eb9p, long lanh nh\u01b0ng th\u1eadt r\u1eafn ch\u1eafc. \u0110\u1eb7t t\u00ean n\u00e0y l\u00e0 mong con s\u1ebd lu\u00f4n xinh \u0111\u1eb9p, cao sang, c\u00f3 b\u1ea3n l\u0129nh, \u0111\u1ea7y s\u1ee9c s\u1ed1ng \u0111\u1ec3 v\u01b0\u1ee3t qua m\u1ecdi kh\u00f3 kh\u0103n trong cu\u1ed9c \u0111\u1eddi. T\u00ean Ng\u00e2n San mang \u00fd ngh\u0129a con l\u00e0 t\u00e0i s\u1ea3n qu\u00fd gi\u00e1 c\u1ee7a cha m\u1eb9 hay c\u00f2n c\u00f3 th\u1ec3 hi\u1ec3u l\u00e0 cha m\u1eb9 mong mu\u1ed1n t\u01b0\u01a1ng lai con lu\u00f4n \u0111\u01b0\u1ee3c \u0111\u1ee7 \u0111\u1ea7y, sung s\u01b0\u1edbng", "sex": 5}
{"first_name": "Nh\u00e3 San", "meaning": "\"Nh\u00e3\" l\u00e0 nh\u00e3 nh\u1eb7n, \u0111\u1eb9p gi\u1ea3n d\u1ecb, kh\u00f4ng ph\u00f4 tr\u01b0\u01a1ng, c\u1ea7u k\u1ef3.  \"San\" l\u00e0 san h\u00f4, m\u1ed9t th\u1ee9 \u0111\u1ed9ng v\u1eadt nh\u1ecf \u1edf trong b\u1ec3 k\u1ebft tinh, h\u00ecnh nh\u01b0 c\u00e0nh c\u00e2y, \u0111\u1eb9p nh\u01b0 ng\u1ecdc, d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c. T\u00ean \"Nh\u00e3 San\" g\u1ee3i l\u00ean h\u00ecnh \u1ea3nh xinh \u0111\u1eb9p, long lanh nh\u01b0ng th\u1eadt r\u1eafn ch\u1eafc. \u0110\u1eb7t t\u00ean n\u00e0y l\u00e0 mong con s\u1ebd lu\u00f4n xinh \u0111\u1eb9p, m\u1ed9c m\u1ea1c, c\u00f3 b\u1ea3n l\u0129nh, \u0111\u1ea7y s\u1ee9c s\u1ed1ng \u0111\u1ec3 v\u01b0\u1ee3t qua m\u1ecdi kh\u00f3 kh\u0103n trong cu\u1ed9c \u0111\u1eddi", "sex": 5}
{"first_name": "San San", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"San San\" d\u00f9ng \u0111\u1ec3 h\u00ecnh dung d\u00e1ng \u0111i th\u01b0\u1edbt tha c\u1ee7a ng\u01b0\u1eddi con g\u00e1i, th\u1eadt duy\u00ean d\u00e1ng, uy\u1ec3n chuy\u1ec3n. \"San San\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean \u0111\u00e1ng y\u00eau cho con g\u00e1i v\u1edbi \u00fd ngh\u0129a mong con xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, t\u00e2m h\u1ed3n trong s\u00e1ng, \u0111\u1ee9c h\u1ea1nh, \u0111oan trang.", "sex": 5}
{"first_name": "Ho\u00e0i Sam", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Ho\u00e0i\" c\u00f3 ngh\u0129a l\u00e0 nh\u1edb, l\u00e0 mong ch\u1edd, tr\u00f4ng ng\u00f3ng. \"Ho\u00e0i\" trong tr\u01b0\u1eddng h\u1ee3p n\u00e0y th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t d\u1ef1a tr\u00ean t\u00e2m t\u01b0 t\u00ecnh c\u1ea3m c\u1ee7a b\u1ed1 m\u1eb9. \"Sam\" c\u00f3 ngh\u0129a l\u00e0 s\u1eafc, b\u00e9n, nh\u1ecdn. Ngo\u00e0i ra \"Sam\" c\u00f2n l\u00e0 t\u00ean m\u1ed9t lo\u00e0i \u0111\u1ed9ng v\u1eadt ch\u00e2n \u0111\u1ed1t \u1edf bi\u1ec3n t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 th\u1ee7y chung, son s\u1eaft, s\u1ed1ng c\u00f3 t\u00ecnh c\u00f3 ngh\u0129a. \u0110\u1eb7t con t\u00ean \"Ho\u00e0i Sam\" l\u00e0 mong con th\u00f4ng minh, s\u1eafc s\u1ea1o, s\u1ed1ng kh\u00f4n kh\u00e9o, hi\u1ec3u bi\u1ebft, m\u1ed9t l\u00f2ng chung th\u1ee7y, s\u1eaft son.", "sex": 5}
{"first_name": "Ng\u1ecdc Sam", "meaning": "\"Ng\u1ecdc\" theo ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng trong, l\u1ea5p l\u00e1nh... th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed. \"Sam\" c\u00f3 ngh\u0129a l\u00e0 s\u1eafc, b\u00e9n, nh\u1ecdn. Ngo\u00e0i ra \"Sam\" c\u00f2n l\u00e0 t\u00ean m\u1ed9t lo\u00e0i \u0111\u1ed9ng v\u1eadt ch\u00e2n \u0111\u1ed1t \u1edf bi\u1ec3n t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 th\u1ee7y chung, son s\u1eaft, s\u1ed1ng c\u00f3 t\u00ecnh c\u00f3 ngh\u0129a. Ng\u01b0\u1eddi t\u00ean \"Ng\u1ecdc Sam\" th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh, s\u1eafc s\u1ea3o, s\u1ed1ng kh\u00f4n kh\u00e9o, hi\u1ec3u bi\u1ebft, t\u1ecfa s\u00e1ng nh\u01b0 h\u00f2n ng\u1ecdc qu\u00fd, mang \u00fd ngh\u0129a l\u00e0 tr\u00e2n b\u1ea3o, l\u00e0 m\u00f3n qu\u00e0 qu\u00fd gi\u00e1 c\u1ee7a t\u1ea1o h\u00f3a.", "sex": 5}
{"first_name": "Nh\u00e3 Sam", "meaning": "Theo ngh\u0129a Ti\u1ebfng Vi\u1ec7t, \"Nh\u00e3\" c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 l\u1ecbch s\u1ef1, nh\u00e3 nh\u1eb7n, h\u00f2a nh\u00e3. \"Sam\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i \u0111\u1ed9ng v\u1eadt ch\u00e2n \u0111\u1ed1t \u1edf bi\u1ec3n t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 th\u1ee7y chung, son s\u1eaft, s\u1ed1ng c\u00f3 t\u00ecnh c\u00f3 ngh\u0129a.", "sex": 5}
{"first_name": "Thanh Sam", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 m\u00e0u xanh, tu\u1ed5i tr\u1ebb, c\u00f2n l\u00e0 s\u1ef1 thanh cao, trong s\u1ea1ch, thanh b\u1ea1ch. \"Sam\" c\u00f3 ngh\u0129a l\u00e0 s\u1eafc, b\u00e9n, nh\u1ecdn. Ngo\u00e0i ra \"Sam\" c\u00f2n l\u00e0 t\u00ean m\u1ed9t lo\u00e0i \u0111\u1ed9ng v\u1eadt ch\u00e2n \u0111\u1ed1t \u1edf bi\u1ec3n t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 th\u1ee7y chung, son s\u1eafc, s\u1ed1ng c\u00f3 t\u00ecnh c\u00f3 ngh\u0129a. Ng\u01b0\u1eddi t\u00ean \"Thanh Sam\" th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh, s\u1eafc s\u1ea3o, s\u1ed1ng kh\u00f4n kh\u00e9o, hi\u1ec3u bi\u1ebft, c\u00f3 kh\u00ed ch\u1ea5t \u0111i\u1ec1m \u0111\u1ea1m, nh\u1eb9 nh\u00e0ng v\u00e0 cao qu\u00fd", "sex": 7}
{"first_name": "Thu Sam", "meaning": "Theo ngh\u0129a Ti\u1ebfng Vi\u1ec7t, \"Thu\" l\u00e0 m\u00f9a thu, l\u00e0 m\u00f9a chuy\u1ec3n ti\u1ebfp t\u1eeb h\u1ea1 sang \u0111\u00f4ng, th\u1eddi ti\u1ebft d\u1ecbu m\u00e1t d\u1ea7n. Ngo\u00e0i ra, \"Thu\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 nh\u1eadn l\u1ea5y, nh\u1eadn v\u1ec1 t\u1eeb nhi\u1ec1u ngu\u1ed3n, nhi\u1ec1u n\u01a1i. Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Sam\" c\u00f3 ngh\u0129a l\u00e0 s\u1eafc, b\u00e9n, nh\u1ecdn. Ngo\u00e0i ra \"Sam\" c\u00f2n l\u00e0 t\u00ean m\u1ed9t lo\u00e0i \u0111\u1ed9ng v\u1eadt ch\u00e2n \u0111\u1ed1t \u1edf bi\u1ec3n t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 th\u1ee7y chung, son s\u1eafc, s\u1ed1ng c\u00f3 t\u00ecnh c\u00f3 ngh\u0129a  Ng\u01b0\u1eddi t\u00ean \"Thu Sam\" th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh, s\u1eafc s\u1ea3o, s\u1ed1ng kh\u00f4n kh\u00e9o, hi\u1ec3u bi\u1ebft, th\u1ee7y chung v\u00e0 nh\u1eadn \u0111\u01b0\u1ee3c nhi\u1ec1u s\u1ef1 y\u00eau th\u01b0\u01a1ng v\u00e0 may m\u1eafn", "sex": 5}
{"first_name": "Th\u00fay Sam", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn vi\u00ean ng\u1ecdc \u0111\u1eb9p, ng\u1ecdc qu\u00fd; \"Sam\" c\u00f3 ngh\u0129a l\u00e0 s\u1eafc, b\u00e9n, nh\u1ecdn.  Ngo\u00e0i ra \"Sam\" c\u00f2n l\u00e0 t\u00ean m\u1ed9t lo\u00e0i \u0111\u1ed9ng v\u1eadt ch\u00e2n \u0111\u1ed1t \u1edf bi\u1ec3n t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 th\u1ee7y chung, son s\u1eaft, s\u1ed1ng c\u00f3 t\u00ecnh c\u00f3 ngh\u0129a. Ng\u01b0\u1eddi t\u00ean \"Th\u00fay Sam\" th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh, s\u1eafc s\u1ea3o, s\u1ed1ng kh\u00f4n kh\u00e9o, hi\u1ec3u bi\u1ebft, lu\u00f4n xinh \u0111\u1eb9p, quy\u1ec1n qu\u00fd, \u0111\u01b0\u1ee3c tr\u00e2n tr\u1ecdng v\u00e0 n\u00e2ng niu.", "sex": 5}
