{"first_name": "Vinh Sam", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Vinh\" c\u00f3 ngh\u0129a l\u00e0 vinh hoa, vinh hi\u1ec3n, \"Sam\" c\u00f3 ngh\u0129a l\u00e0 s\u1eafc, b\u00e9n, nh\u1ecdn. . Ngo\u00e0i ra \"Sam\" c\u00f2n l\u00e0 t\u00ean m\u1ed9t lo\u00e0i \u0111\u1ed9ng v\u1eadt ch\u00e2n \u0111\u1ed1t \u1edf bi\u1ec3n t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 th\u1ee7y chung, son s\u1eafc, s\u1ed1ng c\u00f3 t\u00ecnh c\u00f3 ngh\u0129a. Ng\u01b0\u1eddi t\u00ean \"Vinh Sam\" th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh, s\u1eafc s\u1ea3o, s\u1ed1ng kh\u00f4n kh\u00e9o, hi\u1ec3u bi\u1ebft,c\u00f3 cu\u1ed9c s\u1ed1ng thanh danh vinh hi\u1ec3n, c\u00f4ng danh r\u1ea1ng r\u1ee1, mang l\u1ea1i v\u1ebb vang cho gia \u0111\u00ecnh v\u00e0 d\u00f2ng t\u1ed9c", "sex": 7}
