{"first_name": "Minh U\u1ea9n", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, Minh c\u00f2n c\u00f3 ngh\u0129a ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (b\u00ecnh minh) th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. U\u1ea9n c\u00f3 ngh\u0129a l\u00e0 ti\u1ec1m \u1ea9n s\u1ee9c m\u1ea1nh.  V\u00ec v\u1eady, \u0111\u1eb7t t\u00ean n\u00e0y cho con, b\u1ed1 m\u1eb9 mu\u1ed1n g\u1eedi g\u1eafm v\u00ec s\u1ef1 nghi\u1ec7p t\u01b0\u01a1ng lai c\u1ee7a con m\u00ecnh", "sex": 3}
