{"first_name": "Ch\u1ea5n Uy", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, ch\u1eef \"Ch\u1ea5n\" ngh\u0129a l\u00e0 h\u01b0ng kh\u1edfi, ph\u1ea5n kh\u1edfi,  \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd. \"Ch\u1ea5n Uy\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi bi\u1ebft c\u00e1ch l\u00e0m vui l\u00f2ng m\u1ecdi ng\u01b0\u1eddi, suy ngh\u0129 s\u1eafc b\u00e9n v\u00e0 c\u00f3 c\u00e1ch \u1ee9ng x\u1eed th\u00f4ng minh, th\u01b0\u1eddng l\u00e0 nh\u1eefng ng\u01b0\u1eddi c\u00f3 v\u1ebb ngo\u00e0i thanh tao, thu h\u00fat, c\u00f3 t\u00e0i giao ti\u1ebfp v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean, h\u1ea1nh ph\u00fac", "sex": 3}
