{"first_name": "C\u00f4ng Uy", "meaning": "Ch\u1eef \"C\u00f4ng\" theo ngh\u0129a H\u00e1n Vi\u1ec7t \u00fd ch\u1ec9  c\u00f4ng b\u1eb1ng v\u00e0 ch\u00ednh tr\u1ef1c, kh\u00f4ng nghi\u00eang v\u1ec1 b\u00ean n\u00e0o. \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd.  V\u00ec v\u1eady khi \u0111\u1eb7t t\u00ean n\u00e0y cho con l\u00e0 \u0111\u1ec3 \u0111\u1ec1 c\u1eadp \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi ngay th\u1eb3ng, c\u00f4ng b\u00ecnh m\u00e0 v\u00f4 t\u01b0, t\u1ed1t x\u1ea5u kh\u00f4ng bao che, cho n\u00ean l\u1edbn nh\u1ecf kh\u00f4ng g\u00ec m\u00e0 kh\u00f4ng chuy\u00ean ch\u1edf.", "sex": 3}
{"first_name": "C\u01b0\u1eddng Uy", "meaning": "Ch\u1eef \"C\u01b0\u1eddng\" theo ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 l\u1ef1c l\u01b0\u1ee1ng, uy l\u1ef1c v\u1edbi ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i v\u1ec1 th\u1ec3 ch\u1ea5t, m\u1ea1nh kh\u1ecfe tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd.  V\u00ec v\u1eady \u0111\u1eb7t t\u00ean \"C\u01b0\u1eddng Uy\" cho con \u00fd mong con kh\u1ecfe m\u1ea1nh, c\u00f3 s\u1ee9c l\u1ef1c, c\u1ee9ng c\u1ecfi, kh\u00f4ng d\u1ec5 b\u1ecb khu\u1ea5t ph\u1ee5c.", "sex": 3}
