{"first_name": "\u0110\u00ecnh Uy", "meaning": "\"\u0110\u00ecnh\" trong ti\u1ebfng H\u00e1n-Vi\u1ec7t th\u1ec3 hi\u1ec7n s\u1ef1 m\u1ea1nh m\u1ebd, v\u1eefng ch\u1eafc \u00fd ch\u1ec9 con l\u00e0 ng\u01b0\u1eddi m\u1ecdi ng\u01b0\u1eddi c\u00f3 th\u1ec3 tr\u00f4ng c\u1eady. \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd.  V\u00ec v\u1eady, t\u00ean \"\u0110\u00ecnh Uy\" th\u01b0\u1eddng d\u00f9ng \u0111\u1eb7t t\u00ean cho ng\u01b0\u1eddi con trai v\u1edbi t\u00ednh c\u00e1ch m\u1ea1nh, hi\u00ean ngang c\u00f3 th\u1ebf l\u1ef1c, lu\u00f4n m\u1ea1nh m\u1ebd v\u00e0 \u0111\u1ea7y b\u1ea3n l\u0129nh.", "sex": 3}
