{"first_name": "D\u01b0\u01a1ng Uy", "meaning": "\"D\u01b0\u01a1ng\" trong Th\u00e1i D\u01b0\u01a1ng hay c\u00f2n g\u1ecdi l\u00e0 m\u1eb7t tr\u1eddi \u00fd ch\u1ec9 lu\u00f4n r\u1ea1ng ng\u1eddi, chi\u1ebfu s\u00e1ng.  \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd. V\u1edbi t\u00ean \"D\u01b0\u01a1ng Uy\"  bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a l\u00f2ng trung th\u00e0nh, chung th\u1ee7y s\u00e2u s\u1eafc, s\u1ef1 ki\u00ean \u0111\u1ecbnh \u0111\u00f3 c\u0169ng bi\u1ec3u th\u1ecb cho s\u1ee9c m\u1ea1nh, uy quy\u1ec1n, s\u1ef1 \u1ea5m \u00e1p.", "sex": 3}
{"first_name": "Gia Uy", "meaning": "Gia theo ti\u1ebfng H\u00e1n - Vi\u1ec7t l\u00e0 lo\u00e0i c\u1ecf lau, mang l\u1ea1i \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p, ph\u00fac l\u00e0nh. \"Gia Uy\" \u00fd ch\u1ec9 gia \u0111\u00ecnh, l\u00e0 m\u00e1i nh\u00e0 n\u01a1i m\u1ecdi ng\u01b0\u1eddi sum v\u1ea7y, sinh ho\u1ea1t b\u00ean nhau.", "sex": 3}
