{"first_name": "M\u00e3nh Uy", "meaning": "\"M\u00e3nh Uy\" \u00fd ch\u1ec9 ng\u01b0\u1eddi kh\u1ecfe kho\u1eafn, m\u1ea1nh m\u1ebd, t\u1eeb ch\u1ec9 v\u1ec1 v\u00f3c d\u00e1ng v\u00e0 s\u1ee9c l\u1ef1c c\u1ee7a con ng\u01b0\u1eddi. T\u00ean \"M\u00e3nh Uy\" c\u00f2n th\u1ec3 hi\u1ec7n mong mu\u1ed1n c\u1ee7a cha m\u1eb9 l\u00e0 con kh\u1ecfe m\u1ea1nh, s\u1ee9c kh\u1ecfe, s\u1ed1ng m\u1ea1nh m\u1ebd, ki\u00ean c\u01b0\u1eddng.", "sex": 3}
