{"first_name": "Phong Uy", "meaning": "Ch\u1eef \"Phong\" theo ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 gi\u00f3 d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi m\u1ea1nh m\u1ebd, c\u00f3 kh\u1ea3 n\u0103ng l\u00e3nh \u0111\u1ea1o, ch\u1ec9 huy ng\u01b0\u1eddi kh\u00e1c. \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd. T\u00ean \"Phong Uy\" l\u00e0 mong mu\u1ed1n c\u1ee7a cha m\u1eb9 mu\u1ed1n con m\u00ecnh kh\u1ecfe m\u1ea1nh nh\u01b0 c\u01a1n gi\u00f3 \u0111\u1ec3 \u0111i b\u1ea5t c\u1ee9 n\u01a1i \u0111\u00e2u, l\u00e0m b\u1ea5t c\u1ee9 \u0111i\u1ec1u g\u00ec con mu\u1ed1n, l\u00e0 ng\u01b0\u1eddi ki\u00ean tr\u00ec, d\u0169ng c\u1ea3m v\u00e0 d\u00e1m ngh\u0129 d\u00e1m l\u00e0m v\u00e0 \u0111em l\u1ea1i ni\u1ec1m vui, h\u1ea1nh ph\u00fac cho m\u1ecdi ng\u01b0\u1eddi", "sex": 3}
