{"first_name": "Thi\u00ean Uy", "meaning": "Theo ngh\u0129a  H\u00e1n-Vi\u1ec7t  \"Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eddi,  th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd. T\u1ef1a nh\u01b0 b\u1ea7u tr\u1eddi bao la \u1ea5y,ng\u01b0\u1eddi t\u00ean \"Thi\u00ean Uy\" th\u01b0\u1eddng \u0111\u0129nh \u0111\u1ea1c, lu\u00f4n m\u1ea1nh m\u1ebd, c\u00f3 c\u00e1i nh\u00ecn bao qu\u00e1t, t\u1ea7m nh\u00ecn r\u1ed9ng l\u1edbn.", "sex": 3}
