{"first_name": "Thi\u1ebfu Uy", "meaning": "\"Thi\u1ebfu\" l\u00e0 tr\u1ebb tu\u1ed5i. \"Thi\u1ebfu Uy\" l\u00e0 uy m\u00e3nh, tr\u1ebb tu\u1ed5i, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi n\u0103ng \u0111\u1ed9ng m\u00e3nh li\u1ec7t, h\u00e0nh \u0111\u1ed9ng quy\u1ebft \u0111o\u00e1n.", "sex": 3}
{"first_name": "Th\u1ecbnh Uy", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Th\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ea7y, nhi\u1ec1u, h\u01b0ng v\u01b0\u1ee3ng, ph\u1ed3n vinh, phong ph\u00fa. \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd. \u0110\u1eb7t con t\u00ean \"Th\u1ecbnh Uy\" l\u00e0 mong mu\u1ed1n con c\u00f3 \u0111\u1ee7 t\u00e0i n\u0103ng, cu\u1ed9c s\u1ed1ng sung t\u00fac, gi\u00e0u sang, \u1ea5m no, h\u1ea1nh ph\u00fac.", "sex": 3}
{"first_name": "T\u1ecbnh Uy", "meaning": "Theo ngh\u0129a ti\u1ebfng H\u00e1n, \"T\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 s\u1ea1ch s\u1ebd, thanh khi\u1ebft. B\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u1ed9ng l\u1eaby, xinh \u0111\u1eb9p, y\u00ean t\u0129nh. \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd.  Theo ngh\u0129a \u0111\u00f3, t\u00ean \"T\u1ecbnh Uy\" \u0111\u01b0\u1ee3c \u0111\u1eb7t nh\u1eb1m mong mu\u1ed1n con c\u00f3 dung m\u1ea1o thanh tao, qu\u00fd ph\u00e1i, c\u00f3 cu\u1ed9c s\u1ed1ng an nh\u00e0n, thanh cao", "sex": 3}
{"first_name": "Tr\u00ed Uy", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Tr\u00ed\" l\u00e0 tr\u00ed kh\u00f4n, tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft. T\u00ean \"Tr\u00ed\" l\u00e0 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, tr\u00ed tu\u1ec7, t\u00e0i gi\u1ecfi. \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd.  V\u1edbi t\u00ean \"Tr\u00ed Uy\", cha m\u1eb9 mong con c\u00f3 tri th\u1ee9c, th\u1ea5u hi\u1ec3u \u0111\u1ea1o l\u00fd l\u00e0m ng\u01b0\u1eddi, t\u01b0\u01a1ng lai t\u01b0\u01a1i s\u00e1ng.", "sex": 3}
{"first_name": "Trung Uy", "meaning": "Trung l\u00e0 l\u00f2ng trung th\u00e0nh, l\u00e0 s\u1ef1 t\u1eadn trung, kh\u00f4ng thay l\u00f2ng \u0111\u1ed5i d\u1ea1. \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd, c\u00f3 th\u1ebf l\u1ef1c, lu\u00f4n m\u1ea1nh m\u1ebd v\u00e0 \u0111\u1ea7y b\u1ea3n l\u0129nh. V\u00ec v\u1eady, \"Trung Uy\" th\u01b0\u1eddng d\u00f9ng \u0111\u1eb7t t\u00ean cho ng\u01b0\u1eddi con trai v\u1edbi t\u00ednh c\u00e1ch m\u1ea1nh, hi\u00ean ngang, t\u1eadn t\u00e2m t\u1eadn t\u1ee5y h\u1ebft m\u00ecnh", "sex": 3}
{"first_name": "T\u1eeb Uy", "meaning": "\"T\u1eeb\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ng\u01b0\u1eddi t\u1ed1t l\u00e0nh, hi\u1ec1n t\u1eeb, \u0111\u1ee9c t\u00ednh t\u1ed1t. \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd. T\u00ean \"T\u1eeb Uy\" ngh\u0129a l\u00e0 con s\u1ebd \u0111\u01b0\u1ee3c thi\u00ean ph\u00fa c\u00e1c \u0111\u1ee9c t\u00ednh gi\u1ecfi giang, th\u00f4ng minh, tr\u00ed tu\u1ec7 v\u00e0 t\u00e2m h\u1ed3n hi\u1ec1n l\u00e0nh", "sex": 3}
{"first_name": "Anh Uy\u00ean", "meaning": "Ch\u1eef \"Anh\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 \u201cng\u01b0\u1eddi t\u00e0i gi\u1ecfi\u201d v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n.\"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. V\u00ec v\u1eady t\u00ean \"Anh Uy\u00ean\" th\u1ec3 hi\u1ec7n mong mu\u1ed1n t\u1ed1t \u0111\u1eb9p c\u1ee7a cha m\u1eb9, mong con m\u00ecnh gi\u1ecfi giang, xu\u1ea5t ch\u00fang.", "sex": 5}
{"first_name": "\u00c1nh Uy\u00ean", "meaning": "T\u00ean \"\u00c1nh\"  theo ngh\u0129a H\u00e1n Vi\u1ec7t g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng tia s\u00e1ng do m\u1ed9t v\u1eadt ph\u00e1t ra ho\u1eb7c ph\u1ea3n chi\u1ebfu l\u1ea1i, \u00e1nh s\u00e1ng ph\u1ea3n chi\u1ebfu l\u00f3ng l\u00e1nh, soi r\u1ecdi. \"Uy\u00ean\" \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. V\u00ec v\u1eady \u0111\u1eb7t t\u00ean n\u00e0y cho con ng\u1ee5 \u00fd mong con th\u00f4ng minh khai s\u00e1ng, kh\u1ea3 n\u0103ng tinh vi, t\u01b0\u1eddng t\u1eadn m\u1ecdi chuy\u1ec7n.", "sex": 5}
{"first_name": "B\u1ea1ch Uy\u00ean", "meaning": "\"B\u1ea1ch\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 tr\u1eafng, s\u00e1ng, m\u00e0u c\u1ee7a \u0111\u1ee9c h\u1ea1nh, t\u1eeb bi, tr\u00ed tu\u1ec7, th\u1ec3 hi\u1ec7n s\u1ef1 thanh cao c\u1ee7a t\u00e2m h\u1ed3n. \"Uy\u00ean\" \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. T\u00ean \"B\u1ea1ch Uy\u00ean\" mang \u00fd ngh\u0129a ch\u1ec9 ng\u01b0\u1eddi ph\u00fac h\u1eadu, t\u00e2m trong s\u00e1ng, \u0111\u01a1n gi\u1ea3n th\u1eb3ng ngay, s\u1ed1ng t\u1eeb bi & gi\u00e0u tr\u00ed tu\u1ec7", "sex": 5}
{"first_name": "B\u1ea3o Uy\u00ean", "meaning": "\"B\u1ea3o Uy\u00ean\" c\u00f3 ngh\u0129a l\u00e0 con chim qu\u00fd. Ngo\u00e0i ra, uy\u00ean c\u00f2n c\u00f3 th\u1ec3 hi\u1ec3u l\u00e0 uy\u00ean th\u00e2m, uy\u00ean b\u00e1c. \u0110\u1eb7t t\u00ean n\u00e0y ng\u01b0\u1eddi ta mong mu\u1ed1n sau n\u00e0y s\u1ebd tr\u1edf th\u00e0nh ng\u01b0\u1eddi h\u1ecdc cao hi\u1ec3u r\u1ed9ng.", "sex": 5}
{"first_name": "B\u00edch Uy\u00ean", "meaning": "Ch\u1eef \"B\u00edch\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t lo\u00e0i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. V\u00ec v\u1eady \u0111\u1eb7t t\u00ean \"B\u00edch Uy\u00ean\" cho con, ba m\u1eb9 mong con c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, s\u00e1ng ng\u1eddi, ph\u1ea9m ch\u1ea5t cao qu\u00fd, thanh tao, l\u00e0 ng\u01b0\u1eddi t\u00e0i c\u00e0ng m\u00e0i d\u0169a c\u00e0ng r\u00e8n luy\u1ec7n s\u1ebd c\u00e0ng t\u1ecfa s\u00e1ng.", "sex": 5}
{"first_name": "B\u00ecnh Uy\u00ean", "meaning": "\"B\u00ecnh\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 c\u00f4ng b\u1eb1ng, ngang nhau kh\u00f4ng thi\u00ean l\u1ec7ch, c\u00f4ng ch\u00ednh. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i.  V\u00ec v\u1eady, t\u00ean \"B\u00ecnh Uy\u00ean\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 c\u1ed1t c\u00e1ch, bi\u1ebft ph\u00e2n \u0111\u1ecbnh r\u1ea1ch r\u00f2i, t\u00ednh kh\u00ed \u00f4n h\u00f2a, bi\u1ebft \u0111i\u1ec1u ph\u1ed1i c\u00f4ng vi\u1ec7c, th\u00e1i \u0111\u1ed9 tr\u01b0\u1edbc cu\u1ed9c s\u1ed1ng lu\u00f4n b\u00ecnh t\u0129nh an \u0111\u1ecbnh.", "sex": 5}
{"first_name": "C\u1ea9m Uy\u00ean", "meaning": "\"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 \u0111a s\u1eafc m\u00e0u. \"Uy\u00ean\"  l\u00e0 t\u00ean th\u01b0\u1eddng \u0111\u1eb7t cho ng\u01b0\u1eddi con g\u00e1i, \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p. B\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean \"C\u1ea9m Uy\u00ean\" cho con v\u1edbi \u00fd mu\u1ed1n con mang v\u1ebb \u0111\u1eb9p \u0111a m\u00e0u s\u1eafc v\u00e0 tinh t\u1ebf.", "sex": 5}
{"first_name": "Cao Uy\u00ean", "meaning": "\"Cao\" trong t\u1eeb thanh cao, \u00fd ch\u1ec9 s\u1ef1 thanh tao, nh\u00e3 nh\u1eb7n, \u00fd nh\u1ecb. \"Uy\u00ean\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t l\u00e0 t\u00ean th\u01b0\u1eddng \u0111\u1eb7t cho ng\u01b0\u1eddi con g\u00e1i, \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \u0110\u00e2y l\u00e0 s\u1ef1 k\u1ebft h\u1ee3p t\u1ea1o ra t\u00ean g\u1ecdi v\u1eeba hay, v\u1eeba l\u1ea1 tai th\u01b0\u1eddng d\u00e0nh \u0111\u1eb7t cho ng\u01b0\u1eddi con g\u00e1i", "sex": 5}
{"first_name": "\u0110an Uy\u00ean", "meaning": "\"\u0110an\" theo H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 l\u1ebb, chi\u1ebfc \u00fd ch\u1ec9 s\u1ef1 \u0111\u01a1n gi\u1ea3n, kh\u00f4ng ph\u1ee9c t\u1ea1p c\u1ea7u k\u1ef3. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. T\u00ean \"\u0110an Uy\u00ean\" th\u01b0\u1eddng mang \u00fd ngh\u0129a ch\u1ec9 ng\u01b0\u1eddi gi\u1ea3n d\u1ecb, trong s\u00e1ng, kh\u00f4ng c\u1ea7u k\u1ef3 ph\u1ee9c t\u1ea1p hay ganh \u0111ua.", "sex": 5}
{"first_name": "\u0110\u0103ng Uy\u00ean", "meaning": "\"\u0110\u0103ng\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ng\u1ecdn \u0111\u00e8n. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. T\u00ean \"\u0110\u0103ng Uy\u00ean\" d\u1ef1a tr\u00ean h\u00ecnh \u1ea3nh \u0111\u00f3 mang \u00fd ngh\u0129a l\u00e0 s\u1ef1 soi s\u00e1ng v\u00e0 tinh anh.", "sex": 5}
{"first_name": "\u0110\u00e0o Uy\u00ean", "meaning": "\"Uy\u00ean\" l\u00e0 v\u1ef1c s\u00e2u. \"\u0110\u00e0o Uy\u00ean\" l\u00e0 hoa \u0111\u00e0o b\u00ean n\u00fai cao, th\u1ec3 hi\u1ec7n c\u00e1i \u0111\u1eb9p c\u00f3 kh\u00ed ch\u1ea5t \u0111\u1ed9c \u0111\u00e1o.", "sex": 5}
