{"first_name": "Di\u1ec5m Uy\u00ean", "meaning": "\"\"\"Di\u1ec5m Uy\u00ean\"\" \u00fd ch\u1ec9 v\u1ebb \u0111\u1eb9p ki\u1ec1u di\u1ec5m c\u1ee7a ng\u01b0\u1eddi con g\u00e1i, \u00fd mong con s\u1ebd xinh \u0111\u1eb9p, cao sang, quy\u1ec1n qu\u00fd  khi\u1ebfn ta nh\u00ecn v\u00e0o ph\u1ea3i tr\u1ea7m tr\u1ed3, th\u00e1n ph\u1ee5c.\r\n\"", "sex": 5}
{"first_name": "\u0110\u00ecnh Uy\u00ean", "meaning": "\"\u0110\u00ecnh Uy\u00ean\" l\u00e0 s\u1ef1 ph\u1ed1i h\u1ee3p \u0111\u1eb7c bi\u1ec7t t\u1ea1o ra t\u00ean g\u1ecdi v\u1eeba hay, v\u1eeba \u00fd ngh\u0129a cho con. Trong \u0111\u00f3, \"\u0110\u00ecnh\" th\u1ec3 hi\u1ec7n s\u1ef1 m\u1ea1nh m\u1ebd, v\u1eefng ch\u1eafc \u00fd ch\u1ec9 con l\u00e0 ng\u01b0\u1eddi m\u1ecdi ng\u01b0\u1eddi lu\u00f4n tin t\u01b0\u1edfng. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i.", "sex": 5}
{"first_name": "\u0110\u00f4ng Uy\u00ean", "meaning": "\"\u0110\u00f4ng\" l\u00e0 m\u00f9a \u0111\u00f4ng, m\u1ed9t trong b\u1ed1n m\u00f9a t\u1ea1o n\u00ean v\u00f2ng xoay \u0111\u1ea5t tr\u1eddi. Th\u01b0\u1eddng m\u00f9a \u0111\u00f4ng l\u1ea1nh s\u1ebd khi\u1ebfn con ng\u01b0\u1eddi nh\u1edb \u0111\u1ebfn c\u1ea3m gi\u00e1c \u1ea5m \u00e1p, xum v\u1ea7y b\u00ean nh\u1eefng ng\u01b0\u1eddi th\u00e2n y\u00eau, v\u00ec th\u1ebf m\u00f9a \u0111\u00f4ng th\u01b0\u1eddng t\u1ea1o cho con ng\u01b0\u1eddi c\u1ea3m gi\u00e1c nh\u1edb nhung, bi\u1ebft ch\u1edd \u0111\u1ee3i. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. T\u00ean \"\u0110\u00f4ng Uy\u00ean\" \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi t\u1ec9nh t\u00e1o, th\u00e1i \u0111\u1ed9 b\u00ecnh t\u0129nh, s\u00e2u s\u1eafc.", "sex": 5}
{"first_name": "\u0110\u1ed3ng Uy\u00ean", "meaning": "\"\u0110\u1ed3ng Uy\u00ean\" l\u00e0 m\u1ed9t t\u00ean hay d\u00f9ng \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i v\u1edbi \"\u0110\u1ed3ng\" \u00fd ch\u1ec9 \u0111\u1ee9a tr\u1ebb con, c\u00f2n nh\u1ecf tu\u1ed5i, l\u00e0 t\u00ean m\u1ed9t lo\u1ea1i c\u00e2y. Trong khi \u0111\u00f3 \"Uy\u00ean\" \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i.", "sex": 5}
{"first_name": "Du Uy\u00ean", "meaning": "\"Du\" th\u1ec3 hi\u1ec7n s\u1ef1 t\u1ef1 do t\u1ef1 t\u1ea1i, v\u1edbi mong mu\u1ed1n cu\u1ed9c s\u1ed1ng l\u00fac n\u00e0o c\u0169ng ph\u00f3ng kho\u00e1ng, th\u00fa v\u1ecb v\u00e0 tr\u00e0n ng\u1eadp ni\u1ec1m vui \u0111\u1ebfn t\u1eeb cu\u1ed9c s\u1ed1ng. \"Uy\u00ean\" \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. V\u00ec v\u1eady, khi \u0111\u1eb7t t\u00ean \"Du Uy\u00ean\" cho con, b\u1ed1 m\u1eb9 mong mu\u1ed1n con m\u00ecnh s\u1ebd c\u00f3 cu\u1ed9c s\u1ed1ng s\u00f4i \u0111\u1ed9ng, \u0111\u1ea7y m\u00e0u s\u1eafc, c\u00f3 th\u1ec3 \u0111i ngao du \u0111\u00e2y \u0111\u00f3, kh\u00e1m ph\u00e1 kh\u1eafp n\u01a1i.", "sex": 5}
{"first_name": "\u0110\u1ee9c Uy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\u0110\u1ee9c\" t\u1ee9c l\u00e0 ph\u1ea9m h\u1ea1nh, t\u00e1c phong t\u1ed1t \u0111\u1eb9p, quy ph\u1ea1m m\u00e0 con ng\u01b0\u1eddi ph\u1ea3i tu\u00e2n theo, ch\u1ec9 chung nh\u1eefng vi\u1ec7c t\u1ed1t l\u00e0nh l\u1ea5y \u0111\u1ea1o \u0111\u1ec3 l\u1eadp th\u00e2n. Trong khi \u0111\u00f3  \"Uy\u00ean\" \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \"\u0110\u1ee9c Uy\u00ean\" th\u1ec3 hi\u1ec7n mong mu\u1ed1n c\u1ee7a b\u1ed1 m\u1eb9 con s\u1ebd l\u00e0 c\u00f4 g\u00e1i d\u1ecbu d\u00e0ng, th\u1ee5c \u0111\u1ee9c.", "sex": 5}
{"first_name": "Duy Uy\u00ean", "meaning": "\"Duy Uy\u00ean\" c\u00f3 th\u1ec3 hi\u1ec3u l\u00e0 \"t\u01b0 duy uy\u00ean b\u00e1c\" mang \u00fd ngh\u0129a mong con s\u1ebd lu\u00f4n c\u00f3 m\u1ed9t t\u01b0 duy s\u00e1ng su\u1ed1t, tr\u00ed tu\u1ec7 uy\u00ean th\u00e2m, h\u1ecdc r\u1ed9ng hi\u1ec3u s\u00e2u", "sex": 5}
{"first_name": "Duy\u00a0 Uy\u00ean", "meaning": "\"Duy Uy\u00ean\" c\u00f3 th\u1ec3 hi\u1ec3u l\u00e0 \"t\u01b0 duy uy\u00ean b\u00e1c\" mang \u00fd ngh\u0129a mong con s\u1ebd lu\u00f4n c\u00f3 m\u1ed9t t\u01b0 duy s\u00e1ng su\u1ed1t, tr\u00ed tu\u1ec7 uy\u00ean th\u00e2m, h\u1ecdc r\u1ed9ng hi\u1ec3u s\u00e2u", "sex": 5}
{"first_name": "Gia Uy\u00ean", "meaning": "\"Gia Uy\u00ean\" \u0111\u01b0\u1ee3c hi\u1ec3u con l\u00e0 c\u00f4 g\u00e1i qu\u00fd ph\u00e1i, danh gi\u00e1. Kh\u00f4ng ch\u1ec9 c\u00f3 ngo\u1ea1i h\u00ecnh duy\u00ean d\u00e1ng con c\u00f2n s\u1edf h\u1eefu ph\u1ea9m ch\u1ea5t thanh cao, nh\u00e2n \u00e1i do \u0111\u01b0\u1ee3c \u0111\u00f3n nh\u1eadn y\u00eau th\u01b0\u01a1ng \u0111\u1ee7 \u0111\u1ea7y t\u1eeb b\u1ed1 m\u1eb9.", "sex": 5}
{"first_name": "Giang Uy\u00ean", "meaning": "\"Giang Uy\u00ean\" l\u00e0 t\u00ean hay d\u00f9ng \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i v\u1edbi \u00fd ngh\u0129a: \"Giang\" l\u00e0 d\u00f2ng s\u00f4ng, th\u01b0\u1eddng ch\u1ec9 nh\u1eefng \u0111i\u1ec1u cao c\u1ea3, l\u1edbn lao. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i.", "sex": 5}
{"first_name": "Gi\u00e1ng Uy\u00ean", "meaning": "Ch\u1eef \"Gi\u00e1ng\" kh\u00f4ng ch\u1ec9 cho b\u00e9 s\u1ef1 kh\u00e9o l\u00e9o uy\u1ec3n chuy\u1ec3n m\u00e0 c\u00f2n m\u1ea1nh m\u1ebd khi c\u1ea7n thi\u1ebft, c\u00f9ng v\u1edbi tr\u00ed tu\u1ec7 uy\u00ean th\u00f4ng l\u00e0 \u0111i\u1ec1u b\u1ed1 m\u1eb9 mong \u01b0\u1edbc \u1edf con", "sex": 5}
{"first_name": "H\u00e0 Uy\u00ean", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"H\u00e0\" c\u00f3 ngh\u0129a l\u00e0 s\u00f4ng, l\u00e0 n\u01a1i kh\u01a1i ngu\u1ed3n cho m\u1ed9t cu\u1ed9c s\u1ed1ng d\u1ea1t d\u00e0o, sinh \u0111\u1ed9ng. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i.  T\u00ean \"H\u00e0 Uy\u00ean\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi m\u1ec1m m\u1ea1i hi\u1ec1n h\u00f2a nh\u01b0 con s\u00f4ng m\u00f9a n\u01b0\u1edbc n\u1ed5i m\u00eanh mang, b\u1ea1t ng\u00e0n. \"H\u00e0 Uy\u00ean\" c\u00f2n \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, t\u00e2m t\u00ednh trong s\u00e1ng", "sex": 5}
