{"first_name": "H\u1ea3i Uy\u00ean", "meaning": "Con s\u1ebd c\u00f3 ki\u1ebfn th\u1ee9c uy\u00ean b\u00e1c v\u00e0 nh\u00e2n c\u00e1ch cao c\u1ea3 t\u1ef1a bi\u1ec3n r\u1ed9ng m\u00eanh m\u00f4ng.", "sex": 5}
{"first_name": "H\u00e0m Uy\u00ean", "meaning": "\"H\u00e0m\" t\u1ee9c h\u00e0m \u1ea9n, \u1ea9n ch\u1ee9a v\u00e0  \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. K\u1ebft h\u1ee3p 2 ch\u1eef n\u00e0y \u0111\u1eb7t cho con, b\u1ed1 m\u1eb9 ng\u1ee5 \u00fd r\u1eb1ng con lu\u00f4n l\u00e0 ng\u01b0\u1eddi con g\u00e1i \u1ea9n ch\u1ee9a n\u00e9t duy\u00ean ng\u1ea7m, th\u00f4ng minh v\u00e0 qu\u00fd ph\u00e1i.", "sex": 5}
{"first_name": "H\u1ea1nh Uy\u00ean", "meaning": "Theo H\u00e1n - Vi\u1ec7t, t\u00ean \"H\u1ea1nh\" th\u1ee9 nh\u1ea5t, c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 ph\u00fac l\u1ed9c, l\u00e0 ph\u01b0\u1edbc l\u00e0nh. Ngh\u0129a th\u1ee9 hai l\u00e0 n\u00f3i v\u1ec1 m\u1eb7t \u0111\u1ea1o \u0111\u1ee9c, t\u00ednh n\u1ebft c\u1ee7a con ng\u01b0\u1eddi. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. T\u00ean \"H\u1ea1nh Uy\u00ean\" th\u01b0\u1eddng d\u00f9ng cho n\u1eef, ch\u1ec9 ng\u01b0\u1eddi n\u1ebft na, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, \u0111\u00f4n h\u1eadu, ph\u1ea9m ch\u1ea5t cao \u0111\u1eb9p.", "sex": 5}
{"first_name": "Hi\u1ebfu Uy\u00ean", "meaning": "Ch\u1eef \"Hi\u1ebfu\" l\u00e0 m\u1ed9t trong nh\u1eefng ch\u1eef \u00fd ngh\u0129a, mang n\u1ec1n t\u1ea3ng \u0111ao \u0111\u1ee9c, g\u1eafn li\u1ec1n v\u1edbi nh\u00e2n c\u00e1ch l\u00e0m ng\u01b0\u1eddi theo t\u01b0 t\u01b0\u1edfng c\u1ee7a ng\u01b0\u1eddi ph\u01b0\u01a1ng \u0110\u00f4ng. \"Uy\u00ean\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t l\u00e0 t\u00ean th\u01b0\u1eddng \u0111\u1eb7t cho ng\u01b0\u1eddi con g\u00e1i, \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \"Hi\u1ebfu Uy\u00ean\" th\u1ec3 hi\u1ec7n s\u1ef1 t\u00f4n k\u00ednh, qu\u00fd tr\u1ecdng, lu\u00f4n bi\u1ebft \u01a1n, ghi nh\u1edb nh\u1eefng b\u1eadc sinh th\u00e0nh, tr\u01b0\u1edfng b\u1ed1i, c\u00f3 c\u00f4ng \u01a1n v\u1edbi m\u00ecnh", "sex": 5}
{"first_name": "H\u00f2a Uy\u00ean", "meaning": "\"H\u00f2a\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 \u00eam \u1ea5m, y\u00ean \u1ed5n ch\u1ec9 s\u1ef1 thu\u1eadn h\u1ee3p. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. T\u00ean \"H\u00f2a Uy\u00ean\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i hi\u1ec1n l\u00e0nh, th\u00e1i \u0111\u1ed9 t\u1eeb t\u1ed1n, m\u1ec1m m\u1ecfng, n\u00f3i n\u0103ng nh\u1ecf nh\u1eb9, \u00f4n h\u00f2a.", "sex": 5}
{"first_name": "Ho\u00e0ng Uy\u00ean", "meaning": "\"Ho\u00e0ng\" trong ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 m\u00e0u v\u00e0ng, \u00e1nh s\u1eafc c\u1ee7a v\u00e0ng v\u00e0 \u1edf m\u1ed9t ngh\u0129a kh\u00e1c th\u00ec \"Ho\u00e0ng\" th\u1ec3 hi\u1ec7n s\u1ef1 nghi\u00eam trang, r\u1ef1c r\u1ee1,huy ho\u00e0ng nh\u01b0 b\u1eadc vua ch\u00faa. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. T\u00ean \"Ho\u00e0ng Uy\u00ean\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi v\u0129 \u0111\u1ea1i, c\u00f3 c\u1ed1t c\u00e1ch v\u01b0\u01a1ng gi\u1ea3, v\u1edbi t\u01b0\u01a1ng lai ph\u00fa qu\u00fd, sang gi\u00e0u", "sex": 5}
{"first_name": "H\u1ed3ng Uy\u00ean", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"H\u1ed3ng\" l\u00e0 \u00fd ch\u1ec9 m\u00e0u \u0111\u1ecf , m\u00e0 m\u00e0u \u0111\u1ecf v\u1ed1n th\u1ec3 hi\u1ec7n cho ni\u1ec1m vui, s\u1ef1 may m\u1eafn, c\u00e1t t\u01b0\u1eddng. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i.  Theo th\u00f3i quen \u0111\u1eb7t t\u00ean c\u1ee7a ng\u01b0\u1eddi Vi\u1ec7t, t\u00ean \" H\u1ed3ng Uy\u00ean\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con g\u00e1i v\u00ec \u0111\u00e2y  l\u00e0 t\u00ean lu\u00f4n g\u1ee3i s\u1ef1 t\u01b0\u01a1i vui, xinh \u0111\u1eb9p, gi\u00e0u s\u1ee9c s\u1ed1ng.", "sex": 5}
{"first_name": "Hu\u1ec7 Uy\u00ean", "meaning": "\u201cHu\u1ec7\u201d l\u00e0 tr\u00ed tu\u1ec7, \u00fd ch\u1ec9 th\u00f4ng minh s\u00e1ng su\u1ed1t c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u00f2ng th\u01b0\u01a1ng, l\u00f2ng nh\u00e2n \u00e1i. Khi \u0111i c\u00f9ng v\u1edbi c\u00e1i t\u00ean \"Uy\u00ean\" nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \u0110\u1eb7t t\u00ean \"Hu\u1ec7 U\u00ean\"nh\u1eb1m mu\u1ed1n con g\u00e1i c\u1ee7a ba m\u1eb9 v\u1eeba th\u00f4ng minh, v\u1eeba \u00f4n h\u00f2a k\u00ednh thu\u1eadn.", "sex": 5}
{"first_name": "H\u01b0\u01a1ng Uy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t,\"H\u01b0\u01a1ng\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c ch\u1ecdn \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho con g\u00e1i v\u1edbi \u00fd ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m. \"Uy\u00ean\" \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \"H\u01b0\u01a1ng Uy\u00ean\" l\u00e0 c\u00e1i t\u00ean th\u1ec3 hi\u1ec7n s\u1ef1 d\u1ecbu d\u00e0ng, quy\u1ebfn r\u0169, thanh cao v\u00e0 \u0111\u1eb1m th\u1eafm c\u1ee7a ng\u01b0\u1eddi con g\u00e1i.", "sex": 5}
{"first_name": "H\u1eefu Uy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t, \"H\u1eefu\" c\u00f3 nhi\u1ec1u \u00fd ngh\u0129a tuy nhi\u00ean trong \u0111\u00f3 ngh\u0129a th\u01b0\u1eddng d\u00f9ng l\u00e0 c\u00f3, s\u1edf h\u1eefu. K\u1ebft h\u1ee3p c\u00f9ng \"Uy\u00ean\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t l\u00e0 t\u00ean th\u01b0\u1eddng \u0111\u1eb7t cho ng\u01b0\u1eddi con g\u00e1i, \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. B\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean 'H\u1eefu Uy\u00ean\" cho con v\u1edbi hi v\u1ecdng r\u1eb1ng con s\u1ebd l\u00e0 c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, \u00fd nh\u1ecb", "sex": 5}
{"first_name": "Kh\u1ea3i Uy\u00ean", "meaning": "\"Kh\u1ea3i\" trong H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 vui m\u1eebng, h\u00e2n hoan. \"Uy\u00ean\" \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i.  T\u00ean \"Kh\u1ea3i Uy\u00ean\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi vui v\u1ebb, ho\u1ea1t b\u00e1t, n\u0103ng \u0111\u1ed9ng, r\u1ed9n r\u00e0ng.", "sex": 5}
{"first_name": "Kh\u00e1nh Uy\u00ean", "meaning": "Mong mu\u1ed1n c\u00f3 con g\u00e1i xinh \u0111\u1eb9p, t\u01b0\u01a1i t\u1eafn v\u00e0 r\u1ea1ng ng\u1eddi", "sex": 5}
{"first_name": "Khi\u1ebft Uy\u00ean", "meaning": "\"Khi\u1ebft\" \u00fd ch\u1ec9 s\u1ef1 tinh khi\u1ebft, trong s\u00e1ng. \"Uy\u1ec3n\" \u00fd ch\u1ec9 s\u1ef1 nh\u1eb9 nh\u00e0ng, kh\u00fac chi\u1ebft uy\u1ec3n chuy\u1ec3n th\u1ec3 hi\u1ec7n s\u1ef1 thanh tao tinh t\u1ebf c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. K\u1ebft h\u1ee3p hai ch\u1eef n\u00e0y \u0111\u1eb7t t\u00ean cho con, ba m\u1eb9 ng\u1ee5 \u00fd con l\u00e0 ng\u01b0\u1eddi con g\u00e1i d\u1ecbu d\u00e0ng, tinh t\u1ebf v\u1edbi t\u00e2m h\u1ed3n trong tr\u1eafng  thu\u1ea7n khi\u1ebft.", "sex": 5}
{"first_name": "Khoa Uy\u00ean", "meaning": "T\u00ean \"Khoa\" th\u01b0\u1eddng mang h\u00e0m \u00fd t\u1ed1t \u0111\u1eb9p, ch\u1ec9 s\u1ef1 vi\u1ec7c to l\u1edbn, d\u00f9ng \u0111\u1ec3 n\u00f3i v\u1ec1 ng\u01b0\u1eddi c\u00f3 \u0111\u1ecba v\u1ecb x\u00e3 h\u1ed9i v\u00e0 tr\u00ecnh \u0111\u1ed9 h\u1ecdc v\u1ea5n. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \"Khoa Uy\u00ean\" \u00fd  ch\u1ec9 mong mu\u1ed1n c\u1ee7a b\u1ed1 m\u1eb9 con s\u1ebd l\u00e0 ng\u01b0\u1eddi t\u00e0i n\u0103ng, th\u00f4ng minh, ham h\u1ecdc h\u1ecfi, th\u00e0nh c\u00f4ng sau n\u00e0y.", "sex": 5}
{"first_name": "Kh\u00f4i Uy\u00ean", "meaning": "T\u00ean \"Kh\u00f4i\"  th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi t\u00e0i n\u0103ng b\u1eadc nh\u1ea5t, l\u00e0 ng\u01b0\u1eddi gi\u1ecfi \u0111\u1ee9ng \u0111\u1ea7u trong s\u1ed1 nh\u1eefng ng\u01b0\u1eddi gi\u1ecfi. Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Kh\u00f4i\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 m\u1ed9t th\u1ee9 \u0111\u00e1 \u0111\u1eb9p, qu\u00fd gi\u00e1. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. Ngh\u0129a c\u1ee7a \"Kh\u00f4i Uy\u00ean\" trong t\u00ean g\u1ecdi th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi xinh \u0111\u1eb9p, v\u1ebb ngo\u00e0i \u0111\u00e1ng y\u00eau, ph\u1ea9m ch\u1ea5t th\u00f4ng minh, s\u00e1ng d\u1ea1, l\u00e0 ng\u01b0\u1eddi c\u00f3 t\u00e0i, thi c\u1eed \u0111\u1ed7 \u0111\u1ea1t, th\u00e0nh danh.", "sex": 5}
{"first_name": "Kim Uy\u00ean", "meaning": "T\u00ean \"Kim Uy\u00ean\" v\u1eeba g\u1ee3i l\u00ean v\u1ebb \u0111\u1eb9p quy\u1ec1n qu\u00fd cao sang, v\u1eeba th\u1ec3 hi\u1ec7n mong mu\u1ed1n c\u1ee7a cha m\u1eb9 \u0111\u1ed1i v\u1edbi con c\u00e1i :mong con lu\u00f4n l\u00e0 ng\u01b0\u1eddi bi\u1ebft s\u1ed1ng c\u00f3 t\u00ecnh c\u00f3 ngh\u0129a.", "sex": 5}
{"first_name": "K\u1ef3 Uy\u00ean", "meaning": "\"K\u1ef3 Uy\u00ean\" - m\u1ed9t c\u00e1i t\u00ean v\u1eeba hay l\u1ea1i \u0111\u1ed9c \u0111\u00e1o d\u00e0nh cho c\u00e1c b\u00e9 g\u00e1i. Trong ti\u1ebfng H\u00e1n, n\u1ebfu \u0111\u1eb7t t\u00ean cho con g\u00e1i \"K\u1ef3\" c\u00f3 ngh\u0129a l\u00e0 m\u1ed9t vi\u00ean ng\u1ecdc \u0111\u1eb9p. B\u00ean  c\u1ea1nh \u0111\u00f3, \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i.", "sex": 5}
