{"first_name": "L\u1ec7 Uy\u00ean", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, t\u00ean \"L\u1ec7\" th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 ch\u1ec9 dung m\u1ea1o xinh \u0111\u1eb9p c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i.  \"L\u1ec7 Uy\u00ean\" l\u00e0 s\u1ef1 k\u1ebft h\u1ee3p hay \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho con g\u00e1i.", "sex": 5}
{"first_name": "Linh Uy\u00ean", "meaning": "\"Uy\u00ean\" \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \"Linh\" l\u00e0 lanh l\u1ee3i, nhanh nh\u1eb9n. \"Linh Uy\u00ean\" l\u00e0 c\u00e1i t\u00ean mang \u00fd ngh\u0129a con l\u00e0 c\u00f4 g\u00e1i xinh \u0111\u1eb9p,  c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i, lanh l\u1ee3i, \u0111\u00e1ng y\u00eau, th\u00f4ng minh.", "sex": 5}
