{"first_name": "L\u01b0\u01a1ng Uy\u00ean", "meaning": "\"L\u01b0\u01a1ng\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ng\u01b0\u1eddi t\u1ed1t l\u00e0nh, \u0111\u1ee9c t\u00ednh t\u00e0i gi\u1ecfi, th\u1ec3 hi\u1ec7n nh\u1eefng t\u00e0i n\u0103ng, tr\u00ed tu\u1ec7 \u0111\u01b0\u1ee3c tr\u1eddi ph\u00fa.\"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i.  V\u1edbi t\u00ean \"L\u01b0\u01a1ng Uy\u00ean\", mong con s\u1ebd \u0111\u01b0\u1ee3c thi\u00ean ph\u00fa c\u00e1c \u0111\u1ee9c t\u00ednh gi\u1ecfi giang, th\u00f4ng minh, tr\u00ed tu\u1ec7.", "sex": 5}
{"first_name": "Ly Uy\u00ean", "meaning": "\"Uy\u00ean\" l\u00e0 s\u00e2u th\u1eb3m. \"Ly Uy\u00ean\" l\u00e0 lo\u00e0i hoa \u0111\u1eb9p tinh t\u00fay s\u1eafc s\u1ea3o, ng\u1ee5 \u00fd ng\u01b0\u1eddi con g\u00e1i to\u00e0n m\u1ef9.", "sex": 5}
{"first_name": "Mai Uy\u00ean", "meaning": "M\u01b0\u1ee3n t\u00ean m\u1ed9t lo\u00e0i hoa \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho con. Hoa mai l\u00e0 m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p n\u1edf v\u00e0o \u0111\u1ea7u m\u00f9a xu\u00e2n - m\u1ed9t m\u00f9a xu\u00e2n tr\u00e0n tr\u1ec1 \u01b0\u1edbc m\u01a1 v\u00e0 hy v\u1ecdng. B\u00ean c\u1ea1nh \u0111\u00f3, \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. T\u00ean \"Mai Uy\u00ean\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 v\u00f3c d\u00e1ng thanh t\u00fa, lu\u00f4n tr\u00e0n \u0111\u1ea7y s\u1ee9c s\u1ed1ng \u0111\u1ec3 b\u1eaft \u0111\u1ea7u m\u1ecdi vi\u1ec7c.", "sex": 5}
{"first_name": "H\u1eefu \u01af\u1edbc", "meaning": "\"H\u1eefu\" l\u00e0 l\u1ebd ph\u1ea3i. \"H\u1eefu \u01af\u1edbc\" l\u00e0 cam k\u1ebft \u0111i\u1ec1u ph\u1ea3i, ch\u1ec9 con ng\u01b0\u1eddi c\u00f4ng minh ch\u00ednh tr\u1ef1c, h\u00e0nh \u0111\u1ed9ng v\u00ec \u0111\u1ea1o ngh\u0129a c\u00f4ng khai.", "sex": 3}
{"first_name": "B\u1ea1ch \u01afng", "meaning": "\u0110\u1ea1i b\u00e0ng tr\u1eafng \u0111\u01b0\u1ee3c xem l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng qu\u1ed1c gia v\u1ec1 c\u00e1i \u0111\u1eb9p, s\u1ee9c m\u1ea1nh v\u00e0 t\u1ef1 do c\u1ee7a n\u01b0\u1edbc M\u1ef9. \u0110\u1eb7t t\u00ean cho con theo lo\u00e0i chim uy phong n\u00e0y, b\u1ed1 m\u1eb9 mong mu\u1ed1n con d\u0169ng m\u00e3nh, oai nghi\u00eam.", "sex": 3}
