{"first_name": "L\u00e2m \u01afng", "meaning": "Do s\u1ee9c m\u1ea1nh v\u00e0 v\u1ebb \u0111\u1eb9p v\u1ed1n c\u00f3, chim \u01b0ng \u0111\u01b0\u1ee3c t\u00f4n l\u00e0 ho\u00e0ng t\u1eed c\u1ee7a c\u00e1c lo\u00e0i chim. \u0110\u1eb7t t\u00ean cho con nh\u01b0 lo\u00e0i chim r\u1eebng b\u1ed1 m\u1eb9 mong t\u01b0\u01a1ng lai con s\u1ebd th\u1ecfa ch\u00ed tung ho\u00e0nh n\u0103m ch\u00e2u b\u1ed1n b\u1ec3.", "sex": 3}
