{"first_name": "Nguy\u00ean \u01afng", "meaning": "\"Nguy\u00ean\" theo ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 t\u1eeb ch\u1ec9 v\u00f9ng th\u1ea3o nguy\u00ean, \u0111\u1ed3ng c\u1ecf bao la v\u1eeba c\u00f3 \u00fd ngh\u0129a l\u00e0 c\u0103n nguy\u00ean, ngu\u1ed3n c\u1ed9i.   \"\u01afng\"  l\u00e0 chim \u01b0ng (\u0111\u1ea1i b\u00e0ng) t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 t\u00f4n qu\u00fd, ng\u1ee5 \u00fd nh\u00ecn xa, tr\u00f4ng r\u1ed9ng. T\u00ean \"Nguy\u00ean \u01afng\" mang \u00fd ngh\u0129a con \u0111\u01b0\u1eddng con \u0111i s\u1ebd th\u00eanh thang r\u1ed9ng m\u1ee1 nh\u01b0 th\u1ea3o nguy\u00ean m\u00eanh m\u00f4ng. M\u1ecdi th\u1ee9 \u0111\u1ebfn v\u1edbi con \u0111\u01a1n gi\u1ea3n nh\u1eb9 nh\u00e0ng nh\u01b0 \u0111\u01b0\u1ee3c quay l\u1ea1i l\u00e0 nguy\u00ean b\u1ea3n", "sex": 3}
{"first_name": "Phi \u01afng", "meaning": "\"Phi \u01afng\" c\u0169ng c\u00f3 ngh\u0129a l\u00e0 \" Chim \u01b0ng ph\u00e1 tan kh\u00f4ng trung\", \"\u0110\u1ea1i b\u00e0ng tung c\u00e1nh\" v\u1edbi \u00fd ngh\u0129a: M\u1ed9t khi c\u00f3 t\u00e2m h\u1ed3n r\u1ed9ng m\u1edf nh\u01b0 v\u1eady,con s\u1ebd ph\u00e1t huy \u0111\u01b0\u1ee3c t\u1ed1 ch\u1ea5t \"nh\u00ecn xa tr\u00f4ng r\u1ed9ng\" c\u1ee7a chim \u01b0ng,c\u00f3 c\u00e1i nh\u00ecn s\u1eafc s\u1ea3o,t\u1eadp trung v\u00e0o \u0111\u00fang nh\u1eefng \u0111i\u1ec3m \u0111\u00e1ng ch\u00fa \u00fd,  nh\u1eefng m\u1ee5c ti\u00eau c\u1ee7a m\u00ecnh. \"Phi \u01afng\" c\u00f2n  ti\u00eau bi\u1ec3u cho s\u1ef1 th\u00e0nh c\u00f4ng \u0111\u1eb7c bi\u1ec7t l\u00e0 s\u1ef1 nghi\u1ec7p c\u00f4ng danh.", "sex": 3}
{"first_name": "Ph\u00fac \u01afng", "meaning": "Ch\u1eef  \"Ph\u00fac\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 ch\u1ec9 nh\u1eefng s\u1ef1 t\u1ed1t l\u00e0nh, gi\u00e0u sang, may m\u1eafn.   \"\u01afng\"  l\u00e0 chim \u01b0ng (\u0111\u1ea1i b\u00e0ng) t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 t\u00f4n qu\u00fd, ng\u1ee5 \u00fd nh\u00ecn xa, tr\u00f4ng r\u1ed9ng. T\u00ean \"Ph\u00fac \u01afng\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 ph\u1ea9m ch\u1ea5t t\u1ed1t, lu\u00f4n g\u1eb7p may m\u1eafn, c\u00f3 nhi\u1ec1u c\u01a1 h\u1ed9i t\u1ed1t trong cu\u1ed9c s\u1ed1ng, th\u01b0\u1eddng \u0111\u01b0\u1ee3c qu\u00fd nh\u00e2n gi\u00fap \u0111\u1ee1, \u0111\u00e2y ch\u00ednh l\u00e0 mong mu\u1ed1n m\u00e0 b\u1ea5t c\u1ee9 cha m\u1eb9 n\u00e0o c\u0169ng mong con m\u00ecnh \u0111\u01b0\u1ee3c s\u1ed1ng trong gi\u00e0u sang v\u00e0 g\u1eb7p nhi\u1ec1u may m\u1eafn", "sex": 3}
{"first_name": "Th\u00e1i \u01afng", "meaning": "\"Th\u00e1i\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 hanh th\u00f4ng, thu\u1eadn l\u1ee3i, ch\u1ec9 s\u1ef1 y\u00ean vui, b\u00ecnh y\u00ean, th\u01b0 th\u00e1i.  \"\u01afng\"  l\u00e0 chim \u01b0ng (\u0111\u1ea1i b\u00e0ng) t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 t\u00f4n qu\u00fd, ng\u1ee5 \u00fd nh\u00ecn xa, tr\u00f4ng r\u1ed9ng. \u0110\u1eb7t con t\u00ean \"Th\u00e1i \u01afng \" l\u00e0 mong con c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean vui v\u1ebb, t\u00e2m h\u1ed3n l\u1ea1c quan, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean", "sex": 3}
