{"first_name": "Thi\u00ean \u01afng", "meaning": "C\u00f3 quan ni\u1ec7m cho r\u1eb1ng chim \u01b0ng c\u00f3 th\u1ec3 nh\u00ecn th\u1eb3ng v\u00e0o m\u1eb7t tr\u1eddi,nh\u00ecn th\u1ea5y \u0111i\u1ec1u ng\u01b0\u1eddi tr\u1ea7n m\u1eaft th\u1ecbt kh\u00f4ng th\u1ea5y \u0111\u01b0\u1ee3c. Con s\u1ebd nh\u01b0 chim \u01b0ng d\u0169ng m\u00e3nh, ki\u00eau h\u00e3nh, tung c\u00e1nh v\u00e0o b\u1ea7u tr\u1eddi kho\u00e1ng \u0111\u00e3ng.", "sex": 3}
