{"first_name": "Nh\u1eadt T\u00e2n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u00eat, \"Nh\u1eadt\" c\u00f3 ngh\u0129a l\u00e0 m\u1eb7t tr\u1eddi, \"T\u00e2n\" c\u00f3 ngh\u0129a l\u00e0 m\u1edbi, kh\u1edfi \u0111\u1ea7u. \"Nh\u1eadt T\u00e2n\" \u00fd n\u00f3i \u0111\u1ebfn m\u1eb7t tr\u1eddi xu\u1ea5t hi\u1ec7n, \u0111\u00e2y l\u00e0 m\u1ed9t kh\u1edfi \u0111\u1ea7u m\u1edbi. Cha m\u1eb9 mong con c\u0169ng gi\u1ed1ng nh\u01b0 m\u1eb7t tr\u1eddi s\u1edbm mai, v\u1eeba \u1ea5m \u00e1p v\u1eeba m\u1ea1nh m\u1ebd, c\u00f3 b\u1ea3n l\u0129nh v\u00e0 kh\u00ed ph\u00e1ch, lu\u00f4n r\u1ea1ng ng\u1eddi v\u00e0 t\u1ecfa s\u00e1ng v\u1edbi nh\u1eefng th\u00e0nh c\u00f4ng c\u1ee7a mi\u0300nh.", "sex": 3}
