{"first_name": "M\u1eabn Uy\u00ean", "meaning": "T\u1eeb \"M\u1eabn\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u1eb9n, s\u00e1ng su\u1ed1t, lu\u00f4n nh\u1ea1y b\u00e9n, tinh t\u01b0\u1eddng. T\u00ean \"M\u1eabn Uy\u00ean\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi v\u1eeba c\u00f3 v\u1ebb ngo\u00e0i thanh tao, thu h\u00fat, v\u1eeba c\u00f3 ph\u1ea9m ch\u1ea5t t\u1ed1t, lanh l\u1ee3i, lu\u00f4n s\u1eafc s\u1ea3o th\u00f4ng minh, v\u00ec th\u1ebf lu\u00f4n \u0111\u1ea1t nhi\u1ec1u th\u00e0nh c\u00f4ng trong cu\u1ed9c s\u1ed1ng", "sex": 5}
{"first_name": "M\u1ea1nh Uy\u00ean", "meaning": "\"M\u1ea1nh\" trong t\u1eeb \u0111i\u1ec3n Vi\u1ec7t \u0111\u01b0\u1ee3c d\u1ecbch l\u00e0 kh\u1ecfe kho\u1eafn, m\u1ea1nh m\u1ebd, t\u1eeb ch\u1ec9 v\u1ec1 v\u00f3c d\u00e1ng, s\u1ee9c l\u1ef1c c\u1ee7a con ng\u01b0\u1eddi.  \"Uy\u00ean\" \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. V\u1edbi t\u00ean \"M\u1ea1nh Uy\u00ean\" ba m\u1eb9 mong con tr\u1edf th\u00e0nh ng\u01b0\u1eddi kh\u1ecfe m\u1ea1nh,c\u00f3 s\u1ee9c kh\u1ecfe t\u1ed1t \u00edt b\u1ec7nh t\u1eadt, s\u1ed1ng m\u1ea1nh m\u1ebd, ki\u00ean c\u01b0\u1eddng.", "sex": 5}
