{"first_name": "Ng\u00e2n Uy\u00ean", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a. \"Uy\u00ean\" theo l\u00e0 t\u00ean th\u01b0\u1eddng \u0111\u1eb7t cho ng\u01b0\u1eddi con g\u00e1i, \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \"Ng\u00e2n Uy\u00ean\" ngh\u0129a l\u00e0 con xinh \u0111\u1eb9p, qu\u00fd ph\u00e1i v\u00e0 mong con c\u00f3 cu\u1ed9c s\u1ed1ng gi\u00e0u sang sau n\u00e0y.", "sex": 5}
