{"first_name": "Nhi Uy\u00ean", "meaning": "\"Nhi Uy\u00ean\" l\u00e0 t\u00ean g\u1ecdi hay, \u0111\u00e1ng y\u00eau d\u00e0nh \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i v\u1edbi \u00fd ngh\u0129a: \"Nhi\" trong ti\u1ebfng H\u00e1n- Vi\u1ec7t c\u00f2n l\u00e0 \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p, xinh x\u1eafn, \u0111\u1ea7y n\u1eef t\u00ednh v\u00e0 \"Uy\u00ean\" l\u00e0 t\u00ean th\u01b0\u1eddng \u0111\u1eb7t cho ng\u01b0\u1eddi con g\u00e1i, \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i.", "sex": 5}
{"first_name": "Nh\u01b0 Uy\u00ean", "meaning": "\"Nh\u01b0\" trong ch\u1eef Nh\u01b0 \u00dd th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho n\u1eef, g\u1ee3i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0 h\u01b0\u01a1ng nh\u01b0 hoa, nh\u01b0 ng\u1ecdc nh\u01b0 ng\u00e0. \"Uy\u00ean\" \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \"Nh\u01b0 Uy\u00ean\" l\u00e0 t\u00ean g\u1ecdi th\u01b0\u1eddng mang \u00fd so s\u00e1nh t\u1ed1t \u0111\u1eb9p.", "sex": 5}
{"first_name": "Phi Uy\u00ean", "meaning": "Ch\u1eef \"Phi\" theo ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u01b0 bay - di chuy\u1ec3n v\u1edbi t\u1ed1c \u0111\u1ed9 cao. \"Uy\u00ean\" \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i.  T\u00ean \"Phi Uy\u00ean\" d\u00f9ng \u0111\u1ec3 ch\u1ec9  v\u1ebb ngo\u00e0i thanh t\u00fa, t\u00ednh kh\u00ed \u00f4n h\u00f2a, th\u00f4ng minh,nhanh nh\u1eb9n, l\u00e0m \u0111\u01b0\u1ee3c nhi\u1ec1u \u0111i\u1ec1u phi th\u01b0\u1eddng v\u00e0 v\u01b0\u01a1n t\u1edbi nh\u1eefng t\u1ea7m cao.", "sex": 5}
{"first_name": "Ph\u00fac Uy\u00ean", "meaning": "Ch\u1eef  \"Ph\u00fac\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 ch\u1ec9 nh\u1eefng s\u1ef1 t\u1ed1t l\u00e0nh. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \u0110\u1eb7t t\u00ean \"Ph\u00fac Uy\u00ean\", ba m\u1eb9 mong con l\u00e0 ng\u01b0\u1eddi c\u00f3 ph\u1ea9m ch\u1ea5t t\u1ed1t, lu\u00f4n g\u1eb7p may m\u1eafn, c\u00f3 nhi\u1ec1u c\u01a1 h\u1ed9i t\u1ed1t trong cu\u1ed9c s\u1ed1ng, th\u01b0\u1eddng \u0111\u01b0\u1ee3c qu\u00fd nh\u00e2n gi\u00fap \u0111\u1ee1, lu\u00f4n \u0111\u1ea7y \u0111\u1ee7, g\u1eb7p may m\u1eafn.", "sex": 5}
{"first_name": "Ph\u01b0\u1edbc Uy\u00ean", "meaning": "Ch\u1eef \"Ph\u01b0\u1edbc\" theo ti\u1ebfng h\u00e1n vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 \u0111i\u00ea\u0300u t\u00f4\u0301t la\u0300nh do Tr\u01a1\u0300i Ph\u00e2\u0323t ban cho ng\u01b0\u01a1\u0300i t\u01b0\u0300ng la\u0300m nhi\u00ea\u0300u vi\u00ea\u0323c nh\u00e2n \u0111\u01b0\u0301c. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i.  T\u00ean \"Ph\u01b0\u1edbc Uy\u00ean\" \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con v\u1edbi mong mu\u1ed1n con s\u1ebd l\u00e0 m\u1ed9t ng\u01b0\u1eddi t\u1ed1t, nh\u00e2n \u0111\u1ee9c, lu\u00f4n g\u1eb7p \u0111\u01b0\u1ee3c nh\u1eefng may m\u1eafn, t\u1ed1t l\u00e0nh.", "sex": 5}
