{"first_name": "S\u01a1n Uy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t, \"S\u01a1n\" l\u00e0 n\u00fai, t\u00ednh ch\u1ea5t c\u1ee7a n\u00fai l\u00e0 lu\u00f4n v\u1eefng ch\u00e3i, h\u00f9ng d\u0169ng v\u00e0 tr\u1ea7m t\u0129nh. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. V\u00ec v\u1eady t\u00ean \"S\u01a1n Uy\u00ean\" g\u1ee3i c\u1ea3m gi\u00e1c oai nghi, b\u1ea3n l\u0129nh, c\u00f3 th\u1ec3 l\u00e0 ch\u1ed7 d\u1ef1a v\u1eefng ch\u1eafc an to\u00e0n.", "sex": 5}
{"first_name": "T\u00e2m Uy\u00ean", "meaning": "\"Uy\u00ean\" l\u00e0 s\u00e2u k\u00edn, \"T\u00e2m Uy\u00ean\" ng\u1ee5 \u00fd con ng\u01b0\u1eddi k\u00edn \u0111\u00e1o, nghi\u00eam t\u00fac.", "sex": 5}
