{"first_name": "Th\u00e1i Uy\u00ean", "meaning": "\"Th\u00e1i\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 hanh th\u00f4ng, thu\u1eadn l\u1ee3i, ch\u1ec9 s\u1ef1 y\u00ean vui, b\u00ecnh y\u00ean, th\u01b0 th\u00e1i. B\u00ean c\u1ea1nh \u0111\u00f3, \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \u0110\u1eb7t con t\u00ean \"Th\u00e1i Uy\u00ean\" l\u00e0 mong con c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean vui v\u1ebb, t\u00e2m h\u1ed3n l\u1ea1c quan, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean", "sex": 5}
{"first_name": "Thanh Uy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 m\u00e0u xanh, tu\u1ed5i tr\u1ebb, c\u00f2n l\u00e0 s\u1ef1 thanh cao, trong s\u1ea1ch, thanh b\u1ea1ch. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. Ng\u01b0\u1eddi t\u00ean \"Thanh Uy\u00ean\" th\u01b0\u1eddng c\u00f3 kh\u00ed ch\u1ea5t \u0111i\u1ec1m \u0111\u1ea1m, nh\u1eb9 nh\u00e0ng v\u00e0 cao qu\u00fd", "sex": 5}
{"first_name": "Th\u00e0nh Uy\u00ean", "meaning": "Ch\u1eef  \"Th\u00e0nh\" theo ngh\u0129a  H\u00e1n-Vi\u1ec7t th\u01b0\u1eddng ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 th\u1ec3 ch\u1ea5t kh\u1ecfe m\u1ea1nh, suy ngh\u0129 quy\u1ebft \u0111o\u00e1n, r\u1ea5t v\u1eefng ch\u1ea5t trong suy ngh\u0129 v\u00e0 h\u00e0nh \u0111\u1ed9ng. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i.   Ngo\u00e0i ra \"Th\u00e0nh Uy\u00ean\" c\u00f2n c\u00f3  \u00fd ngh\u0129a l\u00e0 ho\u00e0n th\u00e0nh, tr\u1ecdn v\u1eb9n, lu\u00f4n l\u00e0m m\u1ecdi vi\u1ec7c \u0111\u01b0\u1ee3c ho\u00e0n h\u1ea3o v\u00e0 th\u00e0nh c\u00f4ng", "sex": 5}
