{"first_name": "Thi\u00ean Uy\u00ean", "meaning": "Theo ngh\u0129a  H\u00e1n-Vi\u1ec7t, \"Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eddi,  th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. T\u1ef1a nh\u01b0 b\u1ea7u tr\u1eddi bao la \u1ea5y,ng\u01b0\u1eddi t\u00ean \"Thi\u00ean Uy\u00ean\" th\u01b0\u1eddng \u0111\u0129nh \u0111\u1ea1c, lu\u00f4n m\u1ea1nh m\u1ebd, c\u00f3 c\u00e1i nh\u00ecn bao qu\u00e1t, t\u1ea7m nh\u00ecn r\u1ed9ng l\u1edbn.", "sex": 5}
{"first_name": "Thi\u1ec7n Uy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, \"Thi\u1ec7n\" l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 khen ng\u1ee3i nh\u1eefng con ng\u01b0\u1eddi c\u00f3 ph\u1ea9m ch\u1ea5t hi\u1ec1n l\u00e0nh, t\u1ed1t b\u1ee5ng, l\u01b0\u01a1ng thi\u1ec7n.  \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \u0110\u1eb7t con t\u00ean n\u00e0y l\u00e0 mong con s\u1ebd l\u00e0 ng\u01b0\u1eddi t\u1ed1t, bi\u1ebft tu t\u00e2m t\u00edch \u0111\u1ee9c, y\u00eau th\u01b0\u01a1ng m\u1ecdi ng\u01b0\u1eddi", "sex": 5}
