{"first_name": "Thu\u1eadn Uy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thu\u1eadn\" c\u00f3 ngh\u0129a l\u00e0 noi theo, hay l\u00e0m theo \u0111\u00fang quy lu\u1eadt, l\u00e0 h\u00f2a thu\u1eadn, hi\u1ebfu thu\u1eadn. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i.  T\u00ean \"Thu\u1eadn Uy\u00ean\" l\u00e0 mong con s\u1ebd ngoan ngo\u00e3n, bi\u1ebft v\u00e2ng l\u1eddi, hi\u1ebfu th\u1ea3o v\u1edbi \u00f4ng b\u00e0, cha m\u1eb9, cu\u1ed9c \u0111\u1eddi con s\u1ebd thu\u1eadn bu\u1ed3m xu\u00f4i gi\u00f3, g\u1eb7p nhi\u1ec1u may m\u1eafn", "sex": 5}
