{"first_name": "Th\u00f9y Uy\u00ean", "meaning": "Theo t\u1eeb \u0111i\u1ec3n Ti\u1ebfng Vi\u1ec7t, \"Th\u00f9y\" c\u00f3 ngh\u0129a l\u00e0 th\u00f9y m\u1ecb, n\u1ebft na, \u0111\u1eb1m th\u1eafm. \"Uy\u00ean\" \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i.  \"Th\u00f9y Uy\u00ean\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con lu\u00f4n xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, \u0111\u00e1ng y\u00eau, cu\u1ed9c \u0111\u1eddi con c\u0169ng nh\u1eb9 nh\u00e0ng nh\u01b0 t\u00ednh c\u00e1ch c\u1ee7a con v\u1eady.", "sex": 5}
{"first_name": "Th\u1ee7y Uy\u00ean", "meaning": "Theo ti\u1ebfng H\u00e1n-Vi\u1ec7t, \"Th\u1ee7y\" l\u00e0 n\u01b0\u1edbc, m\u1ed9t trong nh\u1eefng y\u1ebfu t\u1ed1 kh\u00f4ng th\u1ec3 thi\u1ebfu trong \u0111\u1eddi s\u1ed1ng con ng\u01b0\u1eddi. \"Uy\u00ean\" \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i.", "sex": 5}
{"first_name": "Th\u1ee5y Uy\u00ean", "meaning": "Theo ti\u1ebfng H\u00e1n, \"Th\u1ee5y\" l\u00e0 t\u00ean chung c\u1ee7a ng\u1ecdc khu\u00ea ng\u1ecdc b\u00edch, \u0111\u1eddi x\u01b0a d\u00f9ng ng\u1ecdc \u0111\u1ec3 l\u00e0m tin. B\u00ean c\u1ea1nh \u0111\u00f3, \"Uy\u00ean\" \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. T\u00ean \"Th\u1ee5y Uy\u00ean\"  \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd xinh \u0111\u1eb9p, t\u00e2m h\u1ed3n thanh cao, c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac.", "sex": 5}
{"first_name": "Thy Uy\u00ean", "meaning": "\"Thy\" l\u00e0 ki\u1ec3u vi\u1ebft kh\u00e1c c\u1ee7a \"Thi\", hi\u1ec7n nay v\u1edbi t\u00ean ri\u00eang m\u1ecdi ng\u01b0\u1eddi hay s\u1eed d\u1ee5ng \"Thy\" h\u01a1n l\u00e0 \"Thi\", v\u00e0 theo quan \u0111i\u1ec3m c\u1ee7a  ng\u01b0\u1eddi Nh\u1eadt th\u00ec t\u00ean c\u00f3 v\u1ea7n \"y\" s\u1ebd mang nhi\u1ec1u may m\u1eafn v\u00e0 h\u1ea1nh ph\u00fac h\u01a1n \"i\", theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 th\u01a1, d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng g\u00ec m\u1ec1m m\u1ea1i, nh\u1eb9 nh\u00e0ng. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \"Thy Uy\u00ean\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con g\u00e1i s\u1ebd xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, c\u00f4ng dung ng\u00f4n h\u1ea1nh", "sex": 5}
{"first_name": "Tinh Uy\u00ean", "meaning": "\"Tinh\" t\u1ee9c tinh t\u00fa, tinh anh. \"Uy\u00ean\" \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. K\u1ebft h\u1ee3p 2 ch\u1eef n\u00e0y l\u00e0 t\u00ean g\u1ecdi hay \u0111\u1ec3 d\u00e0nh \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i.", "sex": 5}
