{"first_name": "Ho\u00e0ng T\u1ea5n", "meaning": "\"Ho\u00e0ng\" trong ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 m\u00e0u v\u00e0ng, \u00e1nh s\u1eafc c\u1ee7a v\u00e0ng v\u00e0 \u1edf m\u1ed9t ngh\u0129a kh\u00e1c th\u00ec \"Ho\u00e0ng\" th\u1ec3 hi\u1ec7n s\u1ef1 nghi\u00eam trang, r\u1ef1c r\u1ee1,huy ho\u00e0ng nh\u01b0 b\u1eadc vua ch\u00faa. \"T\u1ea5n\" v\u1eeba c\u00f3 ngh\u0129a l\u00e0 h\u1ecfi th\u0103m, th\u1ec3 hi\u1ec7n s\u1ef1 quan t\u00e2m, \u00e2n c\u1ea7n, v\u1eeba c\u00f3 ngh\u0129a l\u00e0 ti\u1ebfn l\u00ean, th\u1ec3 hi\u1ec7n s\u1ef1 ph\u00e1t tri\u1ec3n, th\u0103ng ti\u1ebfn. T\u00ean \"Ho\u00e0ng T\u1ea5n\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi v\u0129 \u0111\u1ea1i, c\u00f3 c\u1ed1t c\u00e1ch v\u01b0\u01a1ng gi\u1ea3, v\u1edbi mong mu\u1ed1n t\u01b0\u01a1ng lai ph\u00fa qu\u00fd, sang gi\u00e0u", "sex": 3}
