{"first_name": "M\u1ed9c T\u1ea5n", "meaning": "M\u1ed9c l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. T\u1ea5n c\u00f3 ngh\u0129a l\u00e0 t\u1ea5n t\u1edbi, ph\u00e1t tri\u1ec3n ng\u00e0y m\u1ed9t t\u1ed1t \u0111\u1eb9p. T\u1ea5n M\u1ed9c ngh\u0129a l\u00e0 cha m\u1eb9 mong con c\u00f3 b\u1ea3n t\u00ednh hi\u1ec1n h\u1eadu, m\u1ed9c m\u1ea1c, b\u00ecnh d\u1ecb & t\u01b0\u01a1ng lai t\u1ed1t \u0111\u1eb9p, ph\u00e1t tri\u1ec3n, th\u0103ng ti\u1ebfn ng\u00e0y c\u00e0ng v\u1ebb vang", "sex": 3}
