{"first_name": "Ng\u1ecdc T\u1ea5n", "meaning": "\"Ng\u1ecdc\" theo ti\u1ebfng H\u00e1n vi\u1ec7t l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh,... th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed.  \"T\u1ea5n\" v\u1eeba c\u00f3 ngh\u0129a l\u00e0 h\u1ecfi th\u0103m, th\u1ec3 hi\u1ec7n s\u1ef1 quan t\u00e2m, \u00e2n c\u1ea7n, v\u1eeba c\u00f3 ngh\u0129a l\u00e0 ti\u1ebfn l\u00ean, th\u1ec3 hi\u1ec7n s\u1ef1 ph\u00e1t tri\u1ec3n, th\u0103ng ti\u1ebfn. T\u00ean Ng\u1ecdc T\u1ea5n th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u1ecfa s\u00e1ng nh\u01b0 h\u00f2n ng\u1ecdc qu\u00fd, c\u00f3 tr\u00e1i tim nh\u00e2n h\u1eadu, s\u1ed1ng \u00e2n c\u1ea7n, th\u00e2n thi\u1ec7n", "sex": 3}
