{"first_name": "Ch\u00e2u Uy\u1ec3n", "meaning": "\"Ch\u00e2u\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 ng\u1ecdc trai, hay c\u00f2n g\u1ecdi l\u00e0 tr\u00e2n ch\u00e2u. V\u1edbi v\u1ebb \u0111\u1eb9p tinh khi\u1ebft v\u00e0 r\u1ef1c s\u00e1ng c\u1ee7a m\u00ecnh, ng\u1ecdc trai mu\u00f4n \u0111\u1eddi v\u1eabn \u0111\u01b0\u1ee3c ng\u1ee3i ca nh\u01b0 m\u1ed9t b\u1ea3o v\u1eadt tuy\u1ec7t \u0111\u1eb9p m\u00e0 \u0111\u1ea1i d\u01b0\u01a1ng bao la \u0111\u00e3 ban t\u1eb7ng cho con ng\u01b0\u1eddi. \"Uy\u1ec3n\" \u00fd ch\u1ec9 s\u1ef1 nh\u1eb9 nh\u00e0ng, kh\u00fac chi\u1ebft uy\u1ec3n chuy\u1ec3n th\u1ec3 hi\u1ec7n s\u1ef1 thanh tao tinh t\u1ebf c\u1ee7a ng\u01b0\u1eddi con g\u00e1i.  V\u00ec v\u1eady, \u0111\u1eb7t t\u00ean \"Ch\u00e2u Uy\u1ec3n\", ba m\u1eb9 ng\u1ee5 \u00fd con l\u00e0 b\u00e1u v\u1eadt v\u00f4 c\u00f9ng qu\u00fd gi\u00e1, lu\u00f4n g\u1eb7p h\u1ea1nh ph\u00fac v\u00e0 r\u1ea1ng ng\u1eddi.", "sex": 5}
{"first_name": "D\u1ea1 Uy\u1ec3n", "meaning": "\"D\u1ea1 Uy\u1ec3n\" l\u00e0 m\u1ed9t t\u00ean hay th\u01b0\u1eddng \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i. Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"D\u1ea1\" c\u00f3 ngh\u0129a l\u00e0 ban \u0111\u00eam. \"Uy\u1ec3n\" \u00fd ch\u1ec9 s\u1ef1 nh\u1eb9 nh\u00e0ng, kh\u00fac chi\u1ebft uy\u1ec3n chuy\u1ec3n th\u1ec3 hi\u1ec7n s\u1ef1 thanh tao tinh t\u1ebf c\u1ee7a ng\u01b0\u1eddi con g\u00e1i", "sex": 5}
{"first_name": "Di\u1ec7u Uy\u1ec3n", "meaning": "\"Di\u1ec7u\" theo ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 \u0111\u1eb9p, l\u00e0 tuy\u1ec7t di\u1ec7u, \u00fd ch\u1ec9 nh\u1eefng \u0111i\u1ec1u tuy\u1ec7t v\u1eddi \u0111\u01b0\u1ee3c t\u1ea1o n\u00ean b\u1edfi s\u1ef1 kh\u00e9o l\u00e9o, k\u00ec di\u1ec7u. \"Uy\u1ec3n\" \u00fd ch\u1ec9 s\u1ef1 nh\u1eb9 nh\u00e0ng, kh\u00fac chi\u1ebft uy\u1ec3n chuy\u1ec3n th\u1ec3 hi\u1ec7n s\u1ef1 thanh tao tinh t\u1ebf c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. T\u00ean \"Di\u1ec7u Uy\u1ec3n\" mang l\u1ea1i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0ng v\u1eabn cu\u1ed1n h\u00fat, \u1ea5n t\u01b0\u1ee3ng n\u00ean th\u01b0\u1eddng ph\u00f9 h\u1ee3p \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i.", "sex": 5}
{"first_name": "\u0110\u00f4ng Uy\u1ec3n", "meaning": "\"\u0110\u00f4ng\" l\u00e0 m\u00f9a \u0111\u00f4ng, m\u1ed9t trong b\u1ed1n m\u00f9a t\u1ea1o n\u00ean v\u00f2ng xoay \u0111\u1ea5t tr\u1eddi. T\u00ean \"\u0110\u00f4ng\" c\u00f2n \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi t\u1ec9nh t\u00e1o, th\u00e1i \u0111\u1ed9 b\u00ecnh t\u0129nh, s\u00e2u s\u1eafc. Trong khi \u0111\u00f3 \"Uy\u1ec3n\" \u00fd ch\u1ec9 s\u1ef1 nh\u1eb9 nh\u00e0ng, kh\u00fac chi\u1ebft uy\u1ec3n chuy\u1ec3n th\u1ec3 hi\u1ec7n s\u1ef1 thanh tao tinh t\u1ebf c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \"\u0110\u00f4ng Uy\u1ec3n\" l\u00e0 t\u00ean hay d\u00f9ng \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i.", "sex": 5}
{"first_name": "H\u00e0 Uy\u1ec3n", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"H\u00e0\" c\u00f3 ngh\u0129a l\u00e0 s\u00f4ng, l\u00e0 n\u01a1i kh\u01a1i ngu\u1ed3n cho m\u1ed9t cu\u1ed9c s\u1ed1ng d\u1ea1t d\u00e0o, sinh \u0111\u1ed9ng. \"Uy\u1ec3n\" \u00fd ch\u1ec9 s\u1ef1 nh\u1eb9 nh\u00e0ng, kh\u00fac chi\u1ebft uy\u1ec3n chuy\u1ec3n th\u1ec3 hi\u1ec7n s\u1ef1 thanh tao tinh t\u1ebf c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. T\u00ean \"H\u00e0 Uy\u1ec3n\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi m\u1ec1m m\u1ea1i hi\u1ec1n h\u00f2a nh\u01b0 con s\u00f4ng m\u00f9a n\u01b0\u1edbc n\u1ed5i m\u00eanh mang, b\u1ea1t ng\u00e0n. \"H\u00e0 Uy\u1ec3n\" c\u00f2n \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, t\u00e2m t\u00ednh trong s\u00e1ng", "sex": 5}
{"first_name": "H\u00e0m Uy\u1ec3n", "meaning": "\"H\u00e0m\" t\u1ee9c h\u00e0m \u1ea9n, \u1ea9n ch\u1ee9a v\u00e0  \"Uy\u1ec3n\" \u00fd ch\u1ec9 s\u1ef1 nh\u1eb9 nh\u00e0ng, kh\u00fac chi\u1ebft uy\u1ec3n chuy\u1ec3n th\u1ec3 hi\u1ec7n s\u1ef1 thanh tao tinh t\u1ebf c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. K\u1ebft h\u1ee3p 2 ch\u1eef n\u00e0y \u0111\u1eb7t cho con, ba m\u1eb9 mong con lu\u00f4n l\u00e0 ng\u01b0\u1eddi duy\u00ean d\u00e1ng, tinh t\u1ebf", "sex": 5}
{"first_name": "H\u1ea1nh Uy\u1ec3n", "meaning": "Theo H\u00e1n - Vi\u1ec7t, t\u00ean \"H\u1ea1nh\" c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 ph\u00fac l\u1ed9c, l\u00e0 ph\u01b0\u1edbc l\u00e0nh. \"H\u1ea1nh\" c\u00f2n ch\u1ec9 v\u1ec1 \u0111\u1ee9c h\u1ea1nh c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \"Uy\u1ec3n\" \u00fd ch\u1ec9 s\u1ef1 nh\u1eb9 nh\u00e0ng, kh\u00fac chi\u1ebft uy\u1ec3n chuy\u1ec3n th\u1ec3 hi\u1ec7n s\u1ef1 thanh tao tinh t\u1ebf.  T\u00ean \"H\u1ea1nh Uy\u1ec3n\" th\u01b0\u1eddng d\u00f9ng cho n\u1eef, ch\u1ec9 ng\u01b0\u1eddi n\u1ebft na, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, \u0111\u00f4n h\u1eadu, ph\u1ea9m ch\u1ea5t cao \u0111\u1eb9p.", "sex": 5}
