{"first_name": "Lam Uy\u1ec3n", "meaning": "\"Lam\" l\u00e0 t\u00ean g\u1ecdi c\u1ee7a m\u1ed9t lo\u1ea1i ng\u1ecdc, c\u00f3 m\u00e0u  t\u1eeb xanh n\u01b0\u1edbc bi\u1ec3n ng\u1ea3 sang xanh l\u00e1 c\u00e2y\"Uy\u1ec3n\" \u00fd ch\u1ec9 s\u1ef1 nh\u1eb9 nh\u00e0ng, kh\u00fac chi\u1ebft uy\u1ec3n chuy\u1ec3n th\u1ec3 hi\u1ec7n s\u1ef1 thanh tao tinh t\u1ebf c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. T\u00ean \"Lam Uy\u1ec3n\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, qu\u00fd ph\u00e1i c\u00f9ng nh\u1eefng ph\u1ea9m ch\u1ea5t cao sang c\u1ee7a b\u1eadc vua ch\u00faa, s\u1ebd mang l\u1ea1i may m\u1eafn, \u0111i\u1ec1m l\u00e0nh cho nh\u1eefng ng\u01b0\u1eddi th\u00e2n y\u00eau", "sex": 5}
