{"first_name": "B\u1ea3o \u00day", "meaning": "Ch\u1eef \"B\u1ea3o\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o.  \"\u00day\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 an \u1ee7i v\u1ed7 v\u1ec1, k\u00ednh ph\u1ee5c, n\u1ec3 ph\u1ee5c.  V\u00ec v\u1eady, t\u00ean \"B\u1ea3o \u00day \"th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con nh\u01b0 h\u00e0m \u00fd con ch\u00ednh l\u00e0 b\u1ea3o v\u1eadt m\u00e0 b\u1ed1 m\u1eb9 lu\u00f4n n\u00e2ng niu, gi\u1eef g\u00ecn. B\u00ean c\u1ea1nh, t\u00ean \"B\u1ea3o \u00day\" c\u00f2n \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 cu\u1ed9c s\u1ed1ng \u1ea5m \u00eam lu\u00f4n \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng.", "sex": 3}
{"first_name": "C\u01b0\u1eddng \u00day", "meaning": "Ch\u1eef \"C\u01b0\u1eddng\" theo ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 l\u1ef1c l\u01b0\u1ee1ng, uy l\u1ef1c v\u1edbi ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i v\u1ec1 th\u1ec3 ch\u1ea5t, m\u1ea1nh kh\u1ecfe tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. \"\u00day\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 an \u1ee7i v\u1ed7 v\u1ec1, k\u00ednh ph\u1ee5c, n\u1ec3 ph\u1ee5c. V\u00ec v\u1eady \u0111\u1eb7t t\u00ean \"C\u01b0\u1eddng \u00day\" cho con v\u1edbi mong mu\u1ed1n con s\u1ebd kh\u1ecfe m\u1ea1nh, c\u00f3 s\u1ee9c l\u1ef1c, c\u1ee9ng c\u1ecfi, kh\u00f4ng d\u1ec5 b\u1ecb khu\u1ea5t ph\u1ee5c", "sex": 3}
{"first_name": "\u0110\u1ea1i \u00day", "meaning": "\"\u0110\u1ea1i\" di\u1ec5n t\u1ea3 s\u1ef1 to l\u1edbn, b\u00e1ch \u0111\u1ea1i, c\u00f3 th\u1ec3 l\u00e0m ch\u1ed7 d\u1ef1a v\u1eefng ch\u1eafc cho m\u1ecdi ng\u01b0\u1eddi, \"\u0111\u1ea1i\" c\u00f2n th\u1ec3 hi\u1ec7n tinh th\u1ea7n qu\u1ea3ng \u0111\u1ea1i, s\u1ef1 r\u1ed9ng r\u00e3i, quang minh ch\u00ednh \u0111\u1ea1i. L\u1ea5y t\u00ean \"\u0110\u1ea1i \u00day\"-t\u00ean g\u1ecdi m\u1ed9t c\u1ea5p h\u00e0m trong qu\u00e2n \u0111\u1ed9i, c\u00f4ng an \u0111\u1eb7t t\u00ean cho con v\u1edbi \u00fd ngh\u0129a mong con c\u00f3 ch\u00ed l\u1edbn, th\u00e0nh c\u00f4ng trong cu\u1ed9c s\u1ed1ng.", "sex": 3}
{"first_name": "Di\u1ec7p \u00day", "meaning": "Theo ti\u1ebfng H\u00e1n- Vi\u1ec7t l\u00e0 ch\u1eef \"Di\u1ec7p\" ch\u00ednh l\u00e0 \"l\u00e1\" trong Kim Chi Ng\u1ecdc Di\u1ec7p (d\u1ecbch l\u00e0 c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc). Trong khi \u0111\u00f3  \"\u00day\" c\u00f3 ngh\u0129a l\u00e0 an \u1ee7i v\u1ed7 v\u1ec1, k\u00ednh ph\u1ee5c, n\u1ec3 ph\u1ee5c. V\u00ec v\u1eady, \u0111\u1eb7t t\u00ean n\u00e0y cho con ng\u1ee5  \u00fd mu\u1ed1n n\u00f3i con nh\u00e0 quy\u1ec1n qu\u00fd sang gi\u00e0u, d\u00f2ng d\u00f5i danh gi\u00e1. B\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n th\u1ec3 hi\u1ec7n mong mu\u1ed1n t\u1ed1t \u0111\u1eb9p c\u1ee7a b\u1ed1 m\u1eb9 \u0111\u1ec3 con m\u00ecnh lu\u00f4n ki\u00eau sa, qu\u00fd ph\u00e1i.", "sex": 5}
{"first_name": "Di\u1ec7u \u00day", "meaning": "\"Di\u1ec7u\" theo ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 \u0111\u1eb9p, l\u00e0 tuy\u1ec7t di\u1ec7u, \u00fd ch\u1ec9 nh\u1eefng \u0111i\u1ec1u tuy\u1ec7t v\u1eddi \u0111\u01b0\u1ee3c t\u1ea1o n\u00ean b\u1edfi s\u1ef1 kh\u00e9o l\u00e9o, k\u00ec di\u1ec7u.  \"\u00day\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 an \u1ee7i v\u1ed7 v\u1ec1, k\u00ednh ph\u1ee5c, n\u1ec3 ph\u1ee5c.  T\u00ean \"Di\u1ec7u \u00day\" mang l\u1ea1i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0ng v\u1eabn cu\u1ed1n h\u00fat, \u1ea5n t\u01b0\u1ee3ng n\u00ean th\u01b0\u1eddng ph\u00f9 h\u1ee3p \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i.", "sex": 5}
{"first_name": "Giang \u00day", "meaning": "\"Giang \u00day\" l\u00e0 t\u00ean g\u1ecdi hay, v\u1eeba l\u1ea1 tai c\u00f3 th\u1ec3 d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho c\u1ea3 nam l\u1eabn n\u1eef v\u1edbi \u00fd ngh\u0129a \u0111\u1ed9c \u0111\u00e1o. Trong \u0111\u00f3, \"Giang\" l\u00e0 d\u00f2ng s\u00f4ng, th\u01b0\u1eddng ch\u1ec9 nh\u1eefng \u0111i\u1ec1u cao c\u1ea3, l\u1edbn lao.\"\u00day\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 an \u1ee7i v\u1ed7 v\u1ec1, k\u00ednh ph\u1ee5c, n\u1ec3 ph\u1ee5c.", "sex": 7}
{"first_name": "H\u00e0 \u00day", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"H\u00e0\" c\u00f3 ngh\u0129a l\u00e0 s\u00f4ng, l\u00e0 n\u01a1i kh\u01a1i ngu\u1ed3n cho m\u1ed9t cu\u1ed9c s\u1ed1ng d\u1ea1t d\u00e0o, sinh \u0111\u1ed9ng. \"\u00day\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 an \u1ee7i v\u1ed7 v\u1ec1, k\u00ednh ph\u1ee5c, n\u1ec3 ph\u1ee5c. T\u00ean \"H\u00e0\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi m\u1ec1m m\u1ea1i hi\u1ec1n h\u00f2a nh\u01b0 con s\u00f4ng m\u00f9a n\u01b0\u1edbc n\u1ed5i m\u00eanh mang, b\u1ea1t ng\u00e0n. V\u1edbi t\u00ean \"H\u00e0 U\u00fd\", ba m\u1eb9 mong con c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, t\u00e2m t\u00ednh trong s\u00e1ng.", "sex": 5}
{"first_name": "H\u1ea1nh \u00day", "meaning": "Theo H\u00e1n - Vi\u1ec7t, t\u00ean \"H\u1ea1nh\" th\u1ee9 nh\u1ea5t, c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 ph\u00fac l\u1ed9c, l\u00e0 ph\u01b0\u1edbc l\u00e0nh. Ngh\u0129a th\u1ee9 hai l\u00e0 n\u00f3i v\u1ec1 m\u1eb7t \u0111\u1ea1o \u0111\u1ee9c, t\u00ednh n\u1ebft c\u1ee7a con ng\u01b0\u1eddi. B\u00ean c\u1ea1nh \u0111\u00f3,  \"\u00day\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 an \u1ee7i v\u1ed7 v\u1ec1, k\u00ednh ph\u1ee5c, n\u1ec3 ph\u1ee5c. T\u00ean \"H\u1ea1nh \u00day\" th\u01b0\u1eddng d\u00f9ng cho n\u1eef, ch\u1ec9 ng\u01b0\u1eddi n\u1ebft na, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, \u0111\u00f4n h\u1eadu, ph\u1ea9m ch\u1ea5t cao \u0111\u1eb9p.", "sex": 5}
{"first_name": "H\u1ed3ng \u00day", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"H\u1ed3ng\" l\u00e0 \u00fd ch\u1ec9 m\u00e0u \u0111\u1ecf , m\u00e0 m\u00e0u \u0111\u1ecf v\u1ed1n th\u1ec3 hi\u1ec7n cho ni\u1ec1m vui, s\u1ef1 may m\u1eafn, c\u00e1t t\u01b0\u1eddng.  \"\u00day\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 an \u1ee7i v\u1ed7 v\u1ec1, k\u00ednh ph\u1ee5c, n\u1ec3 ph\u1ee5c. Theo th\u00f3i quen \u0111\u1eb7t t\u00ean c\u1ee7a ng\u01b0\u1eddi Vi\u1ec7t, t\u00ean \"H\u1ed3ng \u00day\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con g\u00e1i v\u00ec \u0111\u00e2y l\u00e0 c\u00e1i t\u00ean g\u1ee3i l\u00ean h\u00ecnh \u1ea3nh t\u01b0\u01a1i vui, xinh \u0111\u1eb9p, gi\u00e0u s\u1ee9c s\u1ed1ng.", "sex": 5}
{"first_name": "H\u00f9ng \u00day", "meaning": "\"H\u00f9ng\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi d\u0169ng m\u00e3nh, t\u00e0i gi\u1ecfi, \u0111\u00e1ng ng\u01b0\u1ee1ng m\u1ed9. \"\u00day\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 an \u1ee7i v\u1ed7 v\u1ec1, k\u00ednh ph\u1ee5c, n\u1ec3 ph\u1ee5c. H\u00e0m \u00fd khi \u0111\u1eb7t t\u00ean \"H\u00f9ng \u00day\" cho con l\u00e0 mong mu\u1ed1n con tr\u1edf n\u00ean m\u1ea1nh m\u1ebd, oai v\u1ec7, t\u00e0i n\u0103ng ki\u1ec7t xu\u1ea5t, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi t\u00e1n th\u01b0\u1edfng.", "sex": 3}
{"first_name": "Huy\u1ec1n \u00day", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Huy\u1ec1n\" c\u00f3 nhi\u1ec1u ngh\u0129a nh\u01b0 d\u00e2y \u0111\u00e0n, d\u00e2y cung, m\u00e0u \u0111en.  \"\u00day\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 an \u1ee7i v\u1ed7 v\u1ec1, k\u00ednh ph\u1ee5c, n\u1ec3 ph\u1ee5c.  Trong c\u00e1ch \u0111\u1eb7t t\u00ean, th\u01b0\u1eddng \"Huy\u1ec1n \u00day\" d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho b\u00e9 g\u00e1i v\u1edbi mong mu\u1ed1n con c\u00f3 n\u00e9t \u0111\u1eb9p m\u00ea ho\u1eb7c, l\u1ea1 l\u1eabm k\u1ef3 \u1ea3o, lu\u00f4n thu h\u00fat ng\u01b0\u1eddi kh\u00e1c.", "sex": 5}
{"first_name": "Minh Uy\u1ec3n", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed, \"Minh\" c\u00f2n c\u00f3 ngh\u0129a ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (b\u00ecnh minh) th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. \"Minh Uy\u1ec3n\" \u00fd ch\u1ec9 s\u1ef1 nh\u1eb9 nh\u00e0ng, kh\u00fac chi\u1ebft uy\u1ec3n chuy\u1ec3n, thanh tao tinh t\u1ebf c\u1ee7a ng\u01b0\u1eddi con g\u00e1i.", "sex": 5}
{"first_name": "M\u1ed9c Uy\u1ec3n", "meaning": "\"M\u1ed9c\" trong ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 g\u1ed7. Trong t\u00ednh c\u00e1ch \"M\u1ed9c\" \u0111\u01b0\u1ee3c hi\u1ec3u l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c.  \"Uy\u1ec3n\" l\u00e0 nh\u1eb9 nh\u00e0ng, kh\u00fac chi\u1ebft uy\u1ec3n chuy\u1ec3n th\u1ec3 hi\u1ec7n s\u1ef1 thanh tao tinh t\u1ebf c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \u0110\u1eb7t t\u00ean \"M\u1ed9c Uy\u1ec3n\", cha m\u1eb9 mong con s\u1ed1ng gi\u1ea3n d\u1ecb, h\u1ed3n h\u1eadu, ch\u1ea5t ph\u00e1c kh\u00f4ng ganh \u0111ua, bon chen, c\u00f3 m\u1ed9t cu\u1ed9c s\u1ed1ng b\u00ecnh d\u1ecb, an nh\u00e0n, t\u00e2m t\u00ednh chan h\u00f2a.", "sex": 5}
