{"first_name": "Ng\u00e2n Uy\u1ec3n", "meaning": "\"Ng\u00e2n\" theo ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ti\u1ec1n, th\u1ec3 hi\u1ec7n s\u1ef1 qu\u00fd b\u00e1u. B\u00ean c\u1ea1nh \u0111\u00f3,  \"Uy\u1ec3n\" \u00fd ch\u1ec9 s\u1ef1 nh\u1eb9 nh\u00e0ng, kh\u00fac chi\u1ebft uy\u1ec3n chuy\u1ec3n th\u1ec3 hi\u1ec7n s\u1ef1 thanh tao tinh t\u1ebf c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. T\u00ean \"Ng\u00e2n Uy\u1ec3n\" mang \u00fd ngh\u0129a con l\u00e0 t\u00e0i s\u1ea3n qu\u00fd gi\u00e1 c\u1ee7a cha m\u1eb9 hay c\u00f2n c\u00f3 th\u1ec3 hi\u1ec3u l\u00e0 cha m\u1eb9 mong mu\u1ed1n t\u01b0\u01a1ng lai con lu\u00f4n \u0111\u01b0\u1ee3c \u0111\u1ee7 \u0111\u1ea7y, sung s\u01b0\u1edbng.", "sex": 5}
{"first_name": "Ki\u1ec1u \u00day", "meaning": "Theo ti\u1ebfng H\u00e1n, t\u00ean \"Ki\u1ec1u\" mang \u00fd ngh\u0129a l\u00e0 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, c\u00f3 nhan s\u1eafc rung \u0111\u1ed9ng l\u00f2ng ng\u01b0\u1eddi n\u00ean th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con g\u00e1i v\u1edbi mong mu\u1ed1n c\u00e1c b\u00e9 g\u00e1i khi l\u1edbn l\u00ean s\u1ebd c\u00f3 \u0111\u01b0\u1ee3c dung m\u1ea1o xinh x\u1eafn, duy\u00ean d\u00e1ng.  \"\u00day\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 an \u1ee7i v\u1ed7 v\u1ec1, k\u00ednh ph\u1ee5c, n\u1ec3 ph\u1ee5c. \"Ki\u1ec1u \u00day\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i nh\u1eb1m ng\u1ee5 \u00fd con  s\u1ebd l\u00e0  c\u00f4 g\u00e1i th\u00f4ng minh, t\u00e0i s\u1eafc v\u1eb9n to\u00e0n.", "sex": 5}
{"first_name": "Kim \u00day", "meaning": "\"Kim\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ti\u1ec1n, l\u00e0 v\u00e0ng. \"\u00day\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 an \u1ee7i v\u1ed7 v\u1ec1, k\u00ednh ph\u1ee5c, n\u1ec3 ph\u1ee5c. T\u00ean \"Kim \u00day\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c cha m\u1eb9 \u0111\u1eb7t v\u1edbi h\u00e0m \u00fd mong mu\u1ed1n cu\u1ed9c s\u1ed1ng sung t\u00fac, ph\u00fa qu\u00fd v\u1eefng b\u1ec1n, ki\u00ean c\u1ed1 d\u00e0nh cho con c\u00e1i. Ngo\u00e0i ra \"Kim \u00day\" c\u00f2n th\u1ec3 hi\u1ec7n s\u1ef1 qu\u00fd tr\u1ecdng, tr\u00e2n qu\u00fd c\u1ee7a m\u1ecdi ng\u01b0\u1eddi d\u00e0nh cho con", "sex": 7}
{"first_name": "Ng\u1ecdc Uy\u1ec3n", "meaning": "\"Ng\u1ecdc Uy\u1ec3n\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean \u0111\u1eb9p th\u01b0\u1eddng \u0111\u1eb7t cho con g\u00e1i v\u1edbi Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, c\u00f3 \u0111\u1ed9 tinh khi\u1ebft, s\u00e1ng trong, l\u1ea5p l\u00e1nh th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c ho\u1eb7c trang tr\u00ed. \"Uy\u00ean\" c\u00f3 ngh\u0129a l\u00e0 kh\u00fac chi\u1ebft uy\u1ec3n chuy\u1ec3n. T\u00ean \"Ng\u1ecdc Uy\u1ec3n\" g\u1ee3i l\u00ean v\u1ebb \u0111\u1eb9p trong s\u00e1ng, thanh khi\u1ebft c\u1ee7a t\u00e2m h\u1ed3n v\u00e0 tr\u00ed tu\u1ec7.", "sex": 5}
