{"first_name": "M\u1eabn \u00day", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"M\u1eabn\" c\u00f3 ngh\u0129a l\u00e0 ch\u0103m ch\u1ec9, nhanh nh\u1eb9n. \"\u00day\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 an \u1ee7i v\u1ed7 v\u1ec1, k\u00ednh ph\u1ee5c, n\u1ec3 ph\u1ee5c.  T\u00ean \"M\u1eabn \u00day\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi ch\u0103m ch\u1ec9, c\u1ea7n m\u1eabn, si\u00eang n\u0103ng, lu\u00f4n bi\u1ebft c\u1ed1 g\u1eafng v\u00e0 n\u1ed7 l\u1ef1c h\u1ebft m\u00ecnh \u0111\u1ec3 \u0111\u1ea1t \u0111\u01b0\u1ee3c nh\u1eefng m\u1ee5c ti\u00eau s\u1ed1ng v\u00e0 gi\u00fap \u0111\u1ee1 m\u1ecdi ng\u01b0\u1eddi", "sex": 5}
