{"first_name": "Ph\u01b0\u01a1ng Uy\u1ec3n", "meaning": "Ch\u1eef  \"Ph\u01b0\u01a1ng\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi bi\u1ebft \u0111\u1ea1o l\u00fd l\u00e0m ng\u01b0\u1eddi, bi\u1ebft ph\u00e2n bi\u1ec7t t\u1ed1t x\u1ea5u, \u0111\u00fang sai. Th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi s\u00e1ng su\u1ed1t, tr\u00ed tu\u1ec7.  \"Uy\u1ec3n\" \u00fd ch\u1ec9 s\u1ef1 nh\u1eb9 nh\u00e0ng, kh\u00fac chi\u1ebft uy\u1ec3n chuy\u1ec3n th\u1ec3 hi\u1ec7n s\u1ef1 thanh tao, tinh t\u1ebf c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. V\u1edbi t\u00ean  \"Ph\u01b0\u01a1ng Uy\u1ec3n\", ba m\u1eb9 mong con m\u00ecnh lu\u00f4n l\u00e0m nh\u1eefng \u0111i\u1ec1u t\u1ed1t, bi\u1ebft c\u00e1ch \u0111\u1ed1i nh\u00e2n x\u1eed th\u1ebf, l\u00e0 ng\u01b0\u1eddi s\u00e1ng su\u1ed1t.", "sex": 5}
