{"first_name": "Th\u00e1i Uy\u1ec3n", "meaning": "\"Th\u00e1i\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 hanh th\u00f4ng, thu\u1eadn l\u1ee3i, ch\u1ec9 s\u1ef1 y\u00ean vui, b\u00ecnh y\u00ean, th\u01b0 th\u00e1i. \"Uy\u1ec3n\" \u00fd ch\u1ec9 s\u1ef1 nh\u1eb9 nh\u00e0ng, kh\u00fac chi\u1ebft uy\u1ec3n chuy\u1ec3n th\u1ec3 hi\u1ec7n s\u1ef1 thanh tao tinh t\u1ebf c\u1ee7a ng\u01b0\u1eddi con g\u00e1i.  \u0110\u1eb7t con t\u00ean \"Th\u00e1i Uy\u1ec3n\" l\u00e0 mong con c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean vui v\u1ebb, t\u00e2m h\u1ed3n l\u1ea1c quan, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean.", "sex": 5}
