{"first_name": "Th\u01b0\u1ee3ng Uy\u1ec3n", "meaning": "\"Th\u01b0\u1ee3ng Uy\u1ec3n\" c\u00f3 ngh\u0129a l\u00e0 v\u01b0\u1eddn hoa c\u1ee7a nh\u00e0 vua, c\u00f3 m\u1ed9t c\u1ea3nh s\u1eafc ho\u00e0 \u0111\u1ed3ng v\u1edbi thi\u00ean nhi\u00ean. \u0110\u1eb7t t\u00ean n\u00e0y cho con v\u1edbi ng\u1ee5 \u00fd con s\u1ebd s\u1edf h\u1eefu n\u00e9t \u0111\u1eb9p thanh tao tinh t\u1ebf, t\u00e2m t\u00ednh nh\u1eb9 nh\u00e0ng, c\u00e1ch \u0111\u1ed1i nh\u00e2n x\u1eed th\u1ebf kh\u00fac chi\u1ebft uy\u1ec3n chuy\u1ec3n.", "sex": 5}
{"first_name": "Thy Uy\u1ec3n", "meaning": "\"Thy\" l\u00e0 ki\u1ec3u vi\u1ebft kh\u00e1c c\u1ee7a \"Thi\", d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng g\u00ec m\u1ec1m m\u1ea1i, nh\u1eb9 nh\u00e0ng. \"Thy Uy\u1ec3n\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con g\u00e1i s\u1ebd xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, c\u00f4ng dung ng\u00f4n h\u1ea1nh.", "sex": 5}
