{"first_name": "M\u1ea1nh \u00day", "meaning": "\"M\u1ea1nh\" trong t\u1eeb \u0111i\u1ec3n Vi\u1ec7t \u0111\u01b0\u1ee3c d\u1ecbch l\u00e0 kh\u1ecfe kho\u1eafn, m\u1ea1nh m\u1ebd, t\u1eeb ch\u1ec9 v\u1ec1 v\u00f3c d\u00e1ng, s\u1ee9c l\u1ef1c c\u1ee7a con ng\u01b0\u1eddi. \"\u00day\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 an \u1ee7i v\u1ed7 v\u1ec1, k\u00ednh ph\u1ee5c, n\u1ec3 ph\u1ee5c. T\u00ean \"M\u1ea1nh \u00day\" c\u00f3 ngh\u0129a cha m\u1eb9 mong con tr\u1edf th\u00e0nh ng\u01b0\u1eddi kh\u1ecfe m\u1ea1nh, s\u1ee9c kh\u1ecfe t\u1ed1t \u00edt b\u1ec7nh t\u1eadt, s\u1ed1ng m\u1ea1nh m\u1ebd.", "sex": 3}
{"first_name": "Minh \u00day", "meaning": "\"Minh \u00day\" l\u00e0 t\u00ean hay d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho c\u1ea3 con trai l\u1eabn con g\u00e1i. Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, \"Minh\" c\u00f2n d\u00f9ng \u0111\u1ec3 ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (b\u00ecnh minh) th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. \"\u00day\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 an \u1ee7i v\u1ed7 v\u1ec1, k\u00ednh ph\u1ee5c, n\u1ec3 ph\u1ee5c.", "sex": 7}
{"first_name": "Nam \u00day", "meaning": "\"Nam \u00day\" l\u00e0 t\u00ean g\u1ecdi hay, c\u00f3 th\u1ec3 d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho c\u00e1c b\u00e9 trai v\u1edbi \u00fd ngh\u0129a \u0111\u1ed9c \u0111\u00e1o. Nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda Nam.  \"\u00day\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 an \u1ee7i v\u1ed7 v\u1ec1, k\u00ednh ph\u1ee5c, n\u1ec3 ph\u1ee5c. T\u00ean nh\u01b0 l\u1eddi nh\u1eafn, l\u1eddi d\u1ea1y c\u1ee7a cha m\u1eb9 ch\u1ec9 d\u1eabn \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn cho con tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a.", "sex": 3}
{"first_name": "Ng\u1ecdc \u00day", "meaning": "\"Ng\u1ecdc\" theo ti\u1ebfng H\u00e1n vi\u1ec7t l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh, \"\u00day\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 an \u1ee7i v\u1ed7 v\u1ec1, k\u00ednh ph\u1ee5c, n\u1ec3 ph\u1ee5c. T\u00ean \"Ng\u1ecdc  \u00day\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u1ecfa s\u00e1ng nh\u01b0 h\u00f2n ng\u1ecdc qu\u00fd, mang \u00fd ngh\u0129a l\u00e0 tr\u00e2n b\u1ea3o, l\u00e0 m\u00f3n qu\u00e0 qu\u00fd gi\u00e1 c\u1ee7a t\u1ea1o h\u00f3a.", "sex": 5}
{"first_name": "Nguy\u00ean \u00day", "meaning": "\"Nguy\u00ean\" theo ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 t\u1eeb ch\u1ec9 v\u00f9ng th\u1ea3o nguy\u00ean, \u0111\u1ed3ng c\u1ecf bao la v\u1eeba c\u00f3 \u00fd ngh\u0129a l\u00e0 c\u0103n nguy\u00ean, ngu\u1ed3n c\u1ed9i. \"\u00day\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 an \u1ee7i v\u1ed7 v\u1ec1, k\u00ednh ph\u1ee5c, n\u1ec3 ph\u1ee5c. T\u00ean \"Nguy\u00ean \u00day\" mang theo \u01b0\u1edbc nguy\u1ec7n c\u1ee7a ba m\u1eb9 d\u00e0nh cho con r\u1eb1ng: con \u0111\u01b0\u1eddng con \u0111i s\u1ebd th\u00eanh thang r\u1ed9ng m\u1edf nh\u01b0 th\u1ea3o nguy\u00ean m\u00eanh m\u00f4ng.", "sex": 3}
{"first_name": "Tr\u00e0 Uy\u1ec3n", "meaning": "\"Tr\u00e0\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean g\u1ee3i \u0111\u1ebfn s\u1ef1 g\u1ea7n g\u0169i, th\u00e2n y\u00eau. \"Uy\u1ec3n\" \u00fd ch\u1ec9 s\u1ef1 nh\u1eb9 nh\u00e0ng, kh\u00fac chi\u1ebft uy\u1ec3n chuy\u1ec3n th\u1ec3 hi\u1ec7n s\u1ef1 thanh tao tinh t\u1ebf c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \" Tr\u00e0 Uy\u1ec3n\" l\u00e0 t\u00ean hay  ba m\u1eb9 \u0111\u1eb7t cho con v\u1edbi mong mu\u1ed1n con xinh \u0111\u1eb9p, m\u1ed9c m\u1ea1c, c\u00f3 s\u1ee9c s\u1ed1ng m\u1ea1nh m\u1ebd, l\u00e0m \u0111\u01b0\u1ee3c nhi\u1ec1u vi\u1ec7c c\u00f3 \u00edch gi\u00fap ng\u01b0\u1eddi, gi\u00fap \u0111\u1eddi.", "sex": 5}
