{"first_name": "Tuy\u1ebft Xoan", "meaning": "Tuy\u1ebft g\u1ee3i \u0111\u1ebfn  xinh \u0111\u1eb9p, trong tr\u1eafng, tinh kh\u00f4i, thanh cao v\u00e0 quy\u1ec1n qu\u00fd nh\u01b0 nh\u1eefng b\u00f4ng hoa tuy\u1ebft. Tuy\u1ebft Xoan con l\u00e0 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p tinh kh\u00f4i v\u00e0 cao qu\u00fd trong s\u00e1ng nh\u01b0 nh\u1eefng b\u00f4ng hoa tuy\u1ebft.", "sex": 5}
