{"first_name": "Quang X\u01b0ng", "meaning": "\"Quang\" l\u00e0 \u00e1nh s\u00e1ng. \"Quang X\u01b0ng\" l\u00e0 l\u1eddi n\u00f3i t\u01b0\u1eddng t\u1eadn, ch\u1ec9 ng\u01b0\u1eddi c\u00f3 t\u00ednh c\u00e1ch c\u01b0\u01a1ng tr\u1ef1c, h\u00e0nh vi r\u00f5 r\u00e0ng.", "sex": 3}
{"first_name": "Vui Uy\u00ean", "meaning": "\"Uy\u00ean\" \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \"Vui Uy\u00ean\" ngh\u0129a l\u00e0 c\u00f4 g\u00e1i  th\u00f4ng minh, uy\u00ean b\u00e1c v\u00e0 xinh \u0111\u1eb9p, con l\u00e0 ni\u1ec1m vui l\u1edbn c\u1ee7a gia \u0111\u00ecnh.", "sex": 5}
{"first_name": "V\u01b0\u01a1ng Uy\u00ean", "meaning": "T\u00ean \"V\u01b0\u01a1ng\" g\u1ee3i c\u1ea3m gi\u00e1c cao sang, quy\u1ec1n qu\u00fd nh\u01b0 m\u1ed9t v\u1ecb vua. \"Uy\u00ean\" \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \u0110\u00e2y l\u00e0 t\u00ean hay, cao qu\u00fd d\u00e0nh cho c\u00e1c b\u00e9 g\u00e1i", "sex": 5}
{"first_name": "Vy Uy\u00ean", "meaning": "\u0110\u00e2y l\u00e0 t\u00ean g\u1ecdi \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i  v\u1edbi \"Vy\" th\u1ec3 hi\u1ec7n s\u1ef1 t\u1eed t\u1ebf, r\u1ed9ng l\u01b0\u1ee3ng, \u0111\u1ee9c h\u1ea1nh v\u00e0 \"Uy\u00ean\" \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. T\u00ean \"Vy Uy\u00ean\" l\u00e0 \u00fd mu\u1ed1n con m\u00ecnh mang v\u1ebb \u0111\u1eb9p \u0111\u1ee9c h\u1ea1nh v\u00e0 c\u00f3 l\u00f2ng th\u01b0\u01a1ng ng\u01b0\u1eddi.", "sex": 5}
{"first_name": "Xu\u00e2n Uy\u00ean", "meaning": "Con ch\u00ednh l\u00e0 c\u00f4 g\u00e1i ki\u1ec1u di\u1ec5m c\u1ee7a m\u00f9a xu\u00e2n: ng\u1ecdt ng\u00e0o v\u00e0 d\u1ecbu d\u00e0ng \u1ea5m \u00e1p. \u0110\u1eb7t t\u00ean n\u00e0y cho con b\u1ed1 m\u1eb9 th\u1ea7m nh\u1eafn nh\u1ee7 con h\u00e3y lu\u00f4n kho\u00e1c l\u00ean m\u00ecnh s\u1ef1 t\u01b0\u01a1i t\u1eafn c\u1ee7a m\u00f9a xu\u00e2n \u0111\u1ec3 t\u00e2m h\u1ed3n lu\u00f4n vui v\u1ebb, cu\u1ed9c s\u1ed1ng lu\u00f4n ng\u1eadp tr\u00e0n m\u00e0u s\u1eafc.", "sex": 5}
{"first_name": "Y\u1ebfn Uy\u00ean", "meaning": "\"Uy\u00ean\" l\u00e0 c\u00f4  duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \"Y\u1ebfn Uy\u00ean\", ba m\u1eb9 mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh xinh \u0111\u1eb9p v\u00e0 lu\u00f4n vui v\u1ebb h\u1ed3n nhi\u00ean trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
{"first_name": "\u00c1i Xu\u00e2n", "meaning": "T\u00ean \"\u00c1i\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. \"\u00c1i\" c\u00f2n \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 n\u00f3i v\u1ec1 ng\u01b0\u1eddi ph\u1ee5 n\u1eef c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, \u0111oan trang.  \"\u00c1i Xu\u00e2n\" l\u00e0 ng\u01b0\u1eddi con g\u00e1i \u0111oan trang, v\u1eeba c\u00f3 dung nhan v\u00e0 ph\u1ea9m h\u1ea1nh n\u1ebft na \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng, v\u1eeba th\u00f4ng minh, lanh l\u1ee3i tr\u00e0n tr\u1ec1 s\u1ee9c s\u1ed1ng nh\u01b0 m\u00f9a xu\u00e2n.", "sex": 5}
{"first_name": "\u00c1nh Xu\u00e2n", "meaning": "\"\u00c1nh\" l\u00e0 tia s\u00e1ng. \"\u00c1nh Xu\u00e2n\" l\u00e0 tia s\u00e1ng m\u00f9a xu\u00e2n, ng\u1ee5 \u00fd con ng\u01b0\u1eddi s\u1eafc s\u1ea3o m\u1eabn c\u1ea3m, \u0111\u1eb9p \u0111\u1ebd tinh t\u1ebf.", "sex": 5}
{"first_name": "Ba Xu\u00e2n", "meaning": "\"Ba Xu\u00e2n\" l\u00e0 c\u01a1n s\u00f3ng l\u1edbn m\u00f9a xu\u00e2n, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi m\u1ea1nh m\u1ebd nh\u01b0ng thu\u1ea7n h\u1eadu.", "sex": 3}
{"first_name": "B\u1eafc Xu\u00e2n", "meaning": "\"Xu\u00e2n\" l\u00e0 m\u00f9a kh\u1edfi \u0111\u1ea7u s\u1ee9c s\u1ed1ng v\u1ea1n v\u1eadt. \"B\u1eafc Xu\u00e2n\" l\u00e0 th\u00e1i \u0111\u1ed9 \u0111\u1ecbnh h\u01b0\u1edbng chu\u1ea9n m\u1ef1c, nh\u01b0 m\u00f9a xu\u00e2n \u0111\u1ebfn l\u00e0m thay \u0111\u1ed5i cu\u1ed9c s\u1ed1ng t\u1ef1 nhi\u00ean.", "sex": 3}
