{"first_name": "B\u00e1ch Xu\u00e2n", "meaning": "\"Xu\u00e2n\": m\u00f9a xu\u00e2n - m\u00f9a c\u00e2y c\u1ed1i \u0111\u00e2m ch\u1ed3i n\u00e0y l\u1ed9c, bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a tu\u1ed5i tr\u1ebb, s\u1ee9c tr\u1ebb. \"B\u00e1ch\" hay c\u00f2n g\u1ecdi l\u00e0 t\u00f9ng, l\u00e0 th\u00f4ng, mang \u00fd ngh\u0129a nhi\u1ec1u, to l\u1edbn, th\u00f4ng tu\u1ec7. B\u1ed1 m\u1eb9 \u0111\u1eb7t cho con t\u00ean \"B\u00e1ch Xu\u00e2n\" v\u1edbi mong mu\u1ed1n con l\u1edbn l\u00ean s\u1ebd \u0111\u1ea7y n\u0103ng l\u01b0\u1ee3ng, s\u1ee9c s\u1ed1ng nh\u01b0 m\u00f9a xu\u00e2n v\u00e0 lu\u00f4n l\u00e0 ng\u01b0\u1eddi s\u1ed1ng v\u1eefng v\u00e0ng, ki\u00ean \u0111\u1ecbnh", "sex": 3}
{"first_name": "B\u00e0i Xu\u00e2n", "meaning": "\"Xu\u00e2n\" l\u00e0 m\u00f9a xu\u00e2n. Ch\u1eef \"B\u00e0i Xu\u00e2n\" c\u00f3 ngh\u0129a \u0111\u01b0\u1ee3c x\u1ebfp \u0111\u1eb7t v\u00e0o m\u00f9a xu\u00e2n, th\u1eddi \u0111i\u1ec3m kh\u1edfi \u0111\u1ea7u sinh s\u00f4i n\u1ea3y n\u1edf, h\u00e0m \u00fd ng\u01b0\u1eddi t\u00e0i gi\u1ecfi may m\u1eafn, \u0111\u01b0\u1ee3c \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p.", "sex": 3}
