{"first_name": "B\u00e0ng Xu\u00e2n", "meaning": "\"Xu\u00e2n\" vi\u1ebft \u0111\u1ea7y \u0111\u1ee7 l\u00e0 m\u00f9a xu\u00e2n, l\u00e0 m\u00f9a c\u1ee7a c\u00e2y c\u1ed1i \u0111\u00e2m ch\u1ed3i, n\u1ea3y l\u1ed9c, sinh s\u00f4i ph\u00e1t tri\u1ec3n. S\u00e1nh c\u00f9ng t\u00ean  \"B\u00e0ng Xu\u00e2n\" c\u00f3 ngh\u0129a l\u1edbn lao, d\u00e0y d\u1eb7n hay c\u00f2n c\u00f3 ngh\u0129a th\u1ecbnh v\u01b0\u1ee3ng th\u1ec3 hi\u1ec7n r\u00f5 n\u00e9t mong mu\u1ed1n cu\u1ed9c s\u1ed1ng sau n\u00e0y c\u1ee7a con s\u1ebd ph\u1ed3n vinh, sang gi\u00e0u v\u00e0 t\u01b0\u01a1i t\u1ed1t nh\u01b0 m\u00f9a xu\u00e2n \u0111\u00e2m ch\u1ed3i n\u1ea3y l\u1ed9c.", "sex": 3}
{"first_name": "B\u0103ng Xu\u00e2n", "meaning": "\"Xu\u00e2n\" l\u00e0 m\u00f9a xu\u00e2n. \"B\u0103ng Xu\u00e2n\" l\u00e0 b\u0103ng gi\u00e1 m\u00f9a xu\u00e2n, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi c\u00f3 ngh\u1ecb l\u1ef1c, quy\u1ebft \u0111o\u00e1n.", "sex": 5}
{"first_name": "B\u1ea3ng Xu\u00e2n", "meaning": "\"Xu\u00e2n\" l\u00e0 m\u00f9a xu\u00e2n. \"B\u1ea3ng Xu\u00e2n\" ng\u1ee5 \u00fd ng\u01b0\u1eddi may m\u1eafn t\u1ed1t \u0111\u1eb9p, nh\u01b0 \u0111\u01b0\u1ee3c ghi t\u00ean v\u00e0o b\u1ea3ng m\u00f9a xu\u00e2n", "sex": 3}
{"first_name": "Chi\u00eau Xu\u00e2n", "meaning": "\"Chi\u00eau\" l\u00e0 m\u1eddi \u0111\u1ebfn. \"Chi\u00eau Xu\u00e2n\" ngh\u0129a l\u00e0 m\u1eddi m\u00f9a xu\u00e2n \u0111\u1ebfn, ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i cung c\u00e1ch th\u00f9y m\u1ecb, \u0111\u1eb9p \u0111\u1ebd \u0111oan trang.", "sex": 5}
{"first_name": "Di\u1ec7p Xu\u00e2n", "meaning": "Theo ti\u1ebfng H\u00e1n- Vi\u1ec7t l\u00e0 ch\u1eef \"Di\u1ec7p\" ch\u00ednh l\u00e0 \"l\u00e1\" trong Kim Chi Ng\u1ecdc Di\u1ec7p (d\u1ecbch l\u00e0 c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc). V\u00ec v\u1eady, \u0111\u1eb7t t\u00ean n\u00e0y cho con ng\u1ee5  \u00fd mu\u1ed1n n\u00f3i con nh\u00e0 quy\u1ec1n qu\u00fd sang gi\u00e0u, d\u00f2ng d\u00f5i danh gi\u00e1. B\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n th\u1ec3 hi\u1ec7n mong mu\u1ed1n t\u1ed1t \u0111\u1eb9p c\u1ee7a b\u1ed1 m\u1eb9 \u0111\u1ec3 con m\u00ecnh lu\u00f4n ki\u00eau sa, qu\u00fd ph\u00e1i khi \u0111\u01b0\u1ee3c \u0111\u1eb7t t\u00ean n\u00e0y. \"Xu\u00e2n\" l\u00e0 m\u00f9a xu\u00e2n, \u00fd ch\u1ec9 nh\u1ef1ng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p nh\u01b0 lanh l\u1ee3i, \u0111\u1ea1i c\u00e1t, c\u00f3 s\u1ee9c s\u1ed1ng nh\u01b0 m\u00f9a xu\u00e2n. \"Di\u1ec7p Xu\u00e2n\" \u00fd ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, ki\u00eau sa qu\u00fd ph\u00e1i, r\u1ea1ng r\u1ee1 nh\u01b0 m\u00f9a xu\u00e2n.", "sex": 5}
{"first_name": "Di\u1ec7u Xu\u00e2n", "meaning": "\"Di\u1ec7u\" l\u00e0 k\u1ef3 \u1ea3o. \"Di\u1ec7u Xu\u00e2n\" h\u00e0m ngh\u0129a s\u1ef1 k\u1ef3 \u1ea3o c\u1ee7a m\u00f9a xu\u00e2n, ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i xinh t\u01b0\u01a1i ki\u1ec1u di\u1ec5m.", "sex": 5}
