{"first_name": "Ho\u00e0i Xu\u00e2n", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Ho\u00e0i\" c\u00f3 ngh\u0129a l\u00e0 nh\u1edb, l\u00e0 mong ch\u1edd, tr\u00f4ng ng\u00f3ng. T\u00ean \"Ho\u00e0i\" trong tr\u01b0\u1eddng h\u1ee3p n\u00e0y th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t d\u1ef1a tr\u00ean t\u00e2m t\u01b0 t\u00ecnh c\u1ea3m c\u1ee7a b\u1ed1 m\u1eb9. Ngo\u00e0i ra \"Ho\u00e0i\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 t\u1ea5m l\u00f2ng, l\u00e0 t\u00e2m t\u00ednh, t\u00ecnh \u00fd b\u00ean trong con ng\u01b0\u1eddi. T\u00ean \"Ho\u00e0i Xu\u00e2n\" ngh\u0129a l\u00e0 lu\u00f4n gi\u1eef n\u00e9t tr\u1ebb trung, xinh t\u01b0\u01a1i, tr\u00e0n tr\u1ec1 s\u1ee9c s\u1ed1ng.", "sex": 5}
