{"first_name": "Kh\u00e1nh Xu\u00e2n", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Kh\u00e1nh\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng s\u1ef1 vi\u1ec7c vui m\u1eebng, mang c\u1ea3m gi\u00e1c h\u00e2n hoan, th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 di\u1ec5n t\u1ea3 kh\u00f4ng kh\u00ed trong c\u00e1c bu\u1ed5i ti\u1ec7c, bu\u1ed5i l\u1ec5 \u0103n m\u1eebng. T\u00ean \"Kh\u00e1nh\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi \u0111\u1ee9c h\u1ea1nh, t\u1ed1t \u0111\u1eb9p mang l\u1ea1i c\u1ea3m gi\u00e1c vui t\u01b0\u01a1i, hoan h\u1ec9 cho nh\u1eefng ng\u01b0\u1eddi xung quanh. T\u00ean \"Kh\u00e1nh Xu\u00e2n\" mang \u00fd ngh\u0129a m\u1ed9t m\u00f9a xu\u00e2n t\u01b0\u01a1i m\u1edbi, h\u00e2n hoan, mang nhi\u1ec1u h\u1ea1nh ph\u00fac.", "sex": 5}
