{"first_name": "Linh Xu\u00e2n", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Linh\" c\u00f3 ngh\u0129a l\u00e0 c\u00e1i chu\u00f4ng nh\u1ecf \u0111\u00e1ng y\u00eau, ngo\u00e0i ra \"Linh\" c\u00f2n l\u00e0 t\u1eeb \u0111\u1ec3 ch\u1ec9 tinh th\u1ea7n con ng\u01b0\u1eddi, tin t\u01b0\u1edfng v\u00e0o nh\u1eefng \u0111i\u1ec1u k\u00ec di\u1ec7u, th\u1ea7n k\u00ec ch\u01b0a l\u00fd gi\u1ea3i \u0111\u01b0\u1ee3c. V\u1ec1 t\u00ednh c\u00e1ch, trong ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Linh\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u1eb9n, th\u00f4ng minh. T\u00ean \"Linh\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi h\u00e0m \u00fd t\u1ed1t l\u00e0nh, th\u1ec3 hi\u1ec7n s\u1ef1 \u1ee9ng nghi\u1ec7m m\u00e0u nhi\u1ec7m c\u1ee7a nh\u1eefng \u0111i\u1ec1u th\u1ea7n k\u00ec, ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi dung m\u1ea1o \u0111\u00e1ng y\u00eau, t\u00e0i hoa, tinh anh, nhanh nh\u1eb9n, th\u00f4ng minh & lu\u00f4n g\u1eb7p may m\u1eafn, \u0111\u01b0\u1ee3c che ch\u1edf, gi\u00fap \u0111\u1ee1 trong cu\u1ed9c s\u1ed1ng. T\u00ean \"Linh Xu\u00e2n\" ngh\u0129a l\u00e0 chi\u1ebfc chu\u00f4ng nh\u1ecf m\u00f9a xu\u00e2n, mang nhi\u1ec1u \u0111i\u1ec1u t\u1ed1t l\u00e0nh, t\u00e0i hoa v\u00e0 \u0111\u00e1ng y\u00eau.", "sex": 5}
