{"first_name": "Ng\u1ecdc Xu\u00e2n", "meaning": "\"Ng\u1ecdc\" theo ti\u1ebfng H\u00e1n vi\u1ec7t l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh,... th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed. T\u00ean \"Ng\u1ecdc\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u1ecfa s\u00e1ng nh\u01b0 h\u00f2n ng\u1ecdc qu\u00fd, mang \u00fd ngh\u0129a l\u00e0 tr\u00e2n b\u1ea3o, l\u00e0 m\u00f3n qu\u00e0 qu\u00fd gi\u00e1 c\u1ee7a t\u1ea1o h\u00f3a. \u0110\u1eb7t t\u00ean \"Ng\u1ecdc Xu\u00e2n\" ngh\u0129a l\u00e0 vi\u00ean ng\u1ecdc m\u00f9a xu\u00e2n tr\u00e0n tr\u1ec1 s\u1ee9c s\u1ed1ng, xinh \u0111\u1eb9p, r\u1ef1c r\u1ee1 v\u00e0 t\u1ecfa s\u00e1ng.", "sex": 5}
{"first_name": "Nguy\u1ec7t Xu\u00e2n", "meaning": "\"Nguy\u1ec7t\" l\u00e0 tr\u0103ng,  \"Xu\u00e2n\" l\u00e0 m\u00f9a xu\u00e2n. \"Nguy\u1ec7t Xu\u00e2n\" ngh\u0129a l\u00e0 \u00e1nh tr\u0103ng m\u00f9a xu\u00e2n trong s\u00e1ng, thanh tao, xinh \u0111\u1eb9p.", "sex": 5}
