{"first_name": "Ph\u1ee5ng Xu\u00e2n", "meaning": "\"Ph\u1ee5ng\" theo ngh\u0129a  H\u00e1n - Vi\u1ec7t l\u00e0 chim ph\u01b0\u1ee3ng , ph\u01b0\u1ee3ng l\u00e0 h\u00ecnh t\u01b0\u1ee3ng c\u1ee7a th\u00e1nh nh\u00e2n v\u00e0 c\u1ee7a h\u1ea1nh ph\u00fac. T\u1ef1a nh\u01b0 lo\u00e0i chim Ph\u01b0\u1ee3ng, t\u00ean \"Ph\u1ee5ng\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi ng\u01b0\u1eddi c\u00f3 di\u1ec7n m\u1ea1o ho\u00e0n m\u0129, duy\u00ean d\u00e1ng, ph\u1ea9m ch\u1ea5t \u0111\u1ee9c h\u1ea1nh, c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac v\u00e0 quy\u1ec1n qu\u00fd. \"Ph\u1ee5ng Xu\u00e2n\" l\u00e0 con chim ph\u01b0\u1ee3ng m\u00f9a xu\u00e2n xinh \u0111\u1eb9p, ho\u00e0n m\u0129.", "sex": 5}
