{"first_name": "Uy\u00ean Xu\u00e2n", "meaning": "\"Uy\u00ean Xu\u00e2n\", con ch\u00ednh l\u00e0 c\u00f4 g\u00e1i ki\u1ec1u di\u1ec5m c\u1ee7a m\u00f9a xu\u00e2n: ng\u1ecdt ng\u00e0o v\u00e0 d\u1ecbu d\u00e0ng \u1ea5m \u00e1p. \u0110\u1eb7t t\u00ean n\u00e0y cho con b\u1ed1 m\u1eb9 th\u1ea7m nh\u1eafn nh\u1ee7 con h\u00e3y lu\u00f4n kho\u00e1c l\u00ean m\u00ecnh s\u1ef1 t\u01b0\u01a1i t\u1eafn c\u1ee7a m\u00f9a xu\u00e2n \u0111\u1ec3 t\u00e2m h\u1ed3n lu\u00f4n vui v\u1ebb, cu\u1ed9c s\u1ed1ng lu\u00f4n ng\u1eadp tr\u00e0n m\u00e0u s\u1eafc.", "sex": 5}
