{"first_name": "B\u00edch V\u00e2n", "meaning": "Ch\u1eef \"B\u00edch\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t lo\u00e0i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng. V\u00ec v\u1eady t\u00ean \"B\u00edch\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 con ng\u01b0\u1eddi v\u1edbi mong mu\u1ed1n m\u1ed9t dung m\u1ea1o xinh \u0111\u1eb9p, s\u00e1ng ng\u1eddi, m\u1ed9t ph\u1ea9m ch\u1ea5t cao qu\u00fd, thanh tao, l\u00e0 ng\u01b0\u1eddi t\u00e0i c\u00e0ng m\u00e0i d\u0169a c\u00e0ng r\u00e8n luy\u1ec7n s\u1ebd c\u00e0ng t\u1ecfa s\u00e1ng. \"B\u00edch V\u00e2n\" \u00fd ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p d\u1ecbu d\u00e0ng, cao qu\u00fd, thanh tao.", "sex": 5}
{"first_name": "C\u1ea9m V\u00e2n", "meaning": "\"C\u1ea9m\" l\u00e0 m\u1ed9t lo\u1ea1i g\u1ed7 qu\u00fd, \"V\u00e2n\" l\u00e0 m\u00e2y. T\u00ean \"C\u1ea9m V\u00e2n\" \u00fd ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i nh\u1eb9 nh\u00e0nh, thanh tao, qu\u00fd ph\u00e1i.", "sex": 5}
{"first_name": "Chi V\u00e2n", "meaning": "\"V\u00e2n\" c\u00f3 ngh\u0129a l\u00e0 m\u00e2y, th\u1ec3 hi\u1ec7n s\u1ef1 nh\u1eb9 nh\u00e0ng, t\u1ef1 do t\u1ef1 t\u1ea1i \"Chi\" nghi\u0303a la\u0300 ca\u0300nh, trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i. L\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p \u00fd ch\u1ec9 \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc.", "sex": 5}
{"first_name": "\u0110\u00e0i V\u00e2n", "meaning": "\"V\u00e2n\" l\u00e0 m\u00e2y. \"\u0110\u00e0i V\u00e2n\" l\u00e0 \u0111\u00e0i m\u00e2y, ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i cao qu\u00fd ki\u00eau sa, ph\u1ea9m h\u1ea1nh qu\u00fd gi\u00e1.", "sex": 5}
{"first_name": "\u0110\u1ea1i V\u00e2n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"V\u00e2n\" l\u00e0 m\u00e2y. \"\u0110\u1ea1i\" di\u1ec5n t\u1ea3 s\u1ef1 to l\u1edbn, b\u00e1ch \u0111\u1ea1i, \u0111\u1ea1i gia, c\u00f3 th\u1ec3 l\u00e0m ch\u1ed7 d\u1ef1a v\u1eefng ch\u1eafc cho m\u1ecdi ng\u01b0\u1eddi, \"\u0111\u1ea1i\" c\u00f2n th\u1ec3 hi\u1ec7n tinh th\u1ea7n qu\u1ea3ng \u0111\u1ea1i, s\u1ef1 r\u1ed9ng r\u00e3i, quang minh ch\u00ednh \u0111\u1ea1i. \" \u0110\u1ea1i V\u00e2n\", mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi m\u1ea1nh m\u1ebd,c\u00f3 s\u1ee9c kh\u1ecfe t\u1ed1t v\u00e0 l\u00e0 ng\u01b0\u1eddi c\u00f3 tinh th\u1ea7n qu\u1ea3ng \u0111\u1ea1i quang minh ch\u00ednh tr\u1ef1c.", "sex": 3}
