{"first_name": "Di\u1ec7u V\u00e2n", "meaning": "\"Di\u1ec7u\" theo ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 \u0111\u1eb9p, l\u00e0 tuy\u1ec7t di\u1ec7u, \u00fd ch\u1ec9 nh\u1eefng \u0111i\u1ec1u tuy\u1ec7t v\u1eddi \u0111\u01b0\u1ee3c t\u1ea1o n\u00ean b\u1edfi s\u1ef1 kh\u00e9o l\u00e9o, k\u00ec di\u1ec7u. T\u00ean \"Di\u1ec7u\" mang l\u1ea1i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0ng v\u1eabn cu\u1ed1n h\u00fat, \u1ea5n t\u01b0\u1ee3ng n\u00ean th\u01b0\u1eddng ph\u00f9 h\u1ee3p \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i. \"Di\u1ec7u V\u00e2n\" mang \u00fd ngh\u0129a mong con xinh \u0111\u1eb9p v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng nh\u1eb9 nh\u00e0ng, h\u1ea1nh ph\u00fac.", "sex": 5}
