{"first_name": "Ph\u1ee5ng V\u00e2n", "meaning": "\"V\u00e2n\" theo ngh\u0129a H\u00e1n vi\u1ec7t l\u00e0 m\u00e2y, g\u1ee3i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0 \u0111\u00e1m m\u00e2y tr\u1eafng b\u1ed3ng b\u1ec1nh tr\u00ean tr\u1eddi. \"Ph\u1ee5ng\" l\u00e0 chim ph\u01b0\u1ee3ng - l\u00e0 h\u00ecnh t\u01b0\u1ee3ng c\u1ee7a th\u00e1nh nh\u00e2n v\u00e0 c\u1ee7a h\u1ea1nh ph\u00fac. \"Ph\u1ee5ng V\u00e2n\" khi\u1ebfn ta li\u00ean t\u01b0\u1edfng \u0111\u1ebfn h\u00ecnh \u1ea3nh lo\u00e0i chim ph\u01b0\u1ee3ng \u0111ang bay l\u01b0\u1ee3n, vui \u0111\u00f9a c\u00f9ng m\u00e2y. T\u00ean \"V\u00e2n Ph\u1ee5ng\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi ng\u01b0\u1eddi c\u00f3 di\u1ec7n m\u1ea1o ho\u00e0n m\u0129, duy\u00ean d\u00e1ng, ph\u1ea9m ch\u1ea5t \u0111\u1ee9c h\u1ea1nh, c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac v\u00e0 quy\u1ec1n qu\u00fd.", "sex": 5}
