{"first_name": "Qu\u1ef3nh V\u00e2n", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"Qu\u1ef3nh\" l\u00e0 m\u1ed9t vi\u00ean ng\u1ecdc \u0111\u1eb9p v\u00e0 thanh t\u00fa. Ngo\u00e0i ra \"Qu\u1ef3nh\" c\u00f2n l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa lu\u00f4n n\u1edf ng\u00e1t h\u01b0\u01a1ng v\u00e0o ban \u0111\u00eam. T\u00ean \"Qu\u1ef3nh\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi thanh t\u00fa, dung m\u1ea1o xinh \u0111\u1eb9p, b\u1ea3n t\u00ednh khi\u00eam nh\u01b0\u1eddng, thanh cao. K\u1ebft h\u1ee3p v\u1edbi \"V\u00e2n\" g\u1ee3i c\u1ea3m gi\u00e1c neh5 nh\u00e0ng, thanh tho\u00e1t,\"Qu\u1ef3nh V\u00e2n\" mang \u00fd ngh\u0129a \u0111\u00e1m m\u00e2y \u0111\u1eb9p, thanh t\u00fa, \u0111oan trang.", "sex": 5}
