{"first_name": "Giang V\u0129", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"V\u0129\" \u0111\u1ec1u l\u00e0 d\u00f9ng \u0111\u1ec3 h\u00ecnh dung s\u1ef1 v\u1eadt g\u00ec qu\u00fd b\u00e1u hi\u1ebfm c\u00f3, v\u00e0 h\u00ecnh v\u00f3c cao l\u1edbn l\u1ea1 th\u01b0\u1eddng c\u1ea3. Ng\u01b0\u1eddi n\u00e0o c\u00f3 c\u00f4ng to nghi\u1ec7p l\u1edbn \u0111\u1ec1u g\u1ecdi l\u00e0 v\u0129 nh\u00e2n. \"Giang\" l\u00e0 d\u00f2ng s\u00f4ng, th\u01b0\u1eddng ch\u1ec9 nh\u1eefng \u0111i\u1ec1u cao c\u1ea3, l\u1edbn lao. Ng\u01b0\u1eddi ta th\u01b0\u1eddng l\u1ea5y t\u00ean \"Giang\" \u0111\u1eb7t t\u00ean v\u00ec th\u01b0\u1eddng th\u00edch nh\u1eefng h\u00ecnh \u1ea3nh con s\u00f4ng v\u1eeba \u00eam \u0111\u1ec1m, v\u1eeba m\u1ea1nh m\u1ebd nh\u01b0 cu\u1ed9c \u0111\u1eddi con ng\u01b0\u1eddi c\u00f3 l\u00fac th\u0103ng c\u00f3 l\u00fac tr\u1ea7m.\"Giang V\u0129\"mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, \u01b0u t\u00fa l\u00e0 ng\u01b0\u1eddi l\u00e0m \u0111\u01b0\u1ee3c nhi\u1ec1u vi\u1ec7c l\u1edbn lao phi th\u01b0\u1eddng v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng \u00eam \u0111\u1ec1m.", "sex": 3}
