{"first_name": "B\u0103ng M\u1ed9c", "meaning": "\"M\u1ed9c\" l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. T\u00ean \"B\u0103ng\" th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 mi\u00eau t\u1ea3 ng\u01b0\u1eddi con g\u00e1i, dung m\u1ea1o xinh \u0111\u1eb9p. Th\u1ebf n\u00ean d\u1ef1a tr\u00ean 2 y\u1ebfu t\u1ed1 \u0111\u00f3, t\u00ean \"B\u0103ng M\u1ed9c\" mang \u00fd ngh\u0129a con g\u00e1i l\u1edbn l\u00ean s\u1ebd xinh \u0111\u1eb9p, tinh kh\u00f4i v\u00e0 c\u00f3 t\u00e2m h\u1ed3n m\u1ed9c m\u1ea1c, d\u1ec5 g\u1ea7n, b\u00ecnh d\u1ecb. Ngo\u00e0i ra t\u00ean \"M\u1ed9c\" k\u1ebft h\u1ee3p c\u00f9ng b\u1ed9 th\u1ee7y trong t\u00ean \"B\u0103ng\" l\u00e0 \u0111i\u1ec1u l\u00e0nh, mang l\u1ea1i may m\u1eafn, th\u1ecbnh v\u01b0\u1ee3ng.", "sex": 5}
{"first_name": "Ch\u00e2u M\u1ed9c", "meaning": "M\u1ed9c Ch\u00e2u l\u00e0 cao nguy\u00ean r\u1ed9ng l\u1edbn v\u00e0 xinh \u0111\u1eb9p nh\u1ea5t mi\u1ec1n n\u00fai ph\u00eda B\u1eafc, c\u00f3 kh\u00ed h\u1eadu \u00f4n \u0111\u1edbi gi\u00f3 m\u00f9a v\u00e0 nhi\u1ec1u \u0111i\u1ec3m du l\u1ecbch n\u1ed5i ti\u1ebfng. Khi sinh ra v\u00e0 l\u1edbn l\u00ean, nhi\u1ec1u ng\u01b0\u1eddi thay \u0111\u1ed5i n\u01a1i sinh s\u1ed1ng. V\u00ec v\u1eady, b\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean theo nguy\u00ean qu\u00e1n cho con v\u1edbi \u00fd ni\u1ec7m t\u01b0\u1edfng nh\u1edb v\u1ec1 qu\u00ea nh\u00e0, ho\u1eb7c c\u00f3 th\u1ec3 \u0111\u00e2y l\u00e0 \u0111\u1ecba \u0111i\u1ec3m g\u1eafn li\u1ec1n v\u1edbi t\u00ecnh y\u00eau b\u1ed1 m\u1eb9 ho\u1eb7c ghi d\u1ea5u k\u1ef7 ni\u1ec7m n\u01a1i con sinh ra \u0111\u1eddi.", "sex": 5}
{"first_name": "Chi M\u1ed9c", "meaning": "\"M\u1ed9c\" trong ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 g\u1ed7. Trong t\u00ednh c\u00e1ch M\u1ed9c \u0111\u01b0\u1ee3c hi\u1ec3u l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. Chi\" nghi\u0303a la\u0300 ca\u0300nh, trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i.  L\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p \u00fd ch\u1ec9 \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. \u0110\u1eb7t t\u00ean \"M\u1ed9c Chi\" cha m\u1eb9 mong con s\u1ed1ng gi\u1ea3n d\u1ecb, h\u1ed3n h\u1eadu, ch\u1ea5t ph\u00e1c kh\u00f4ng ganh \u0111ua, bon chen, m\u1ed9t cu\u1ed9c s\u1ed1ng b\u00ecnh d\u1ecb, an nh\u00e0n, t\u00e2m t\u00ednh chan h\u00f2a, th\u00e2n \u00e1i", "sex": 5}
{"first_name": "Du M\u1ed9c", "meaning": "M\u1ed9c l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. Du l\u00e0 di \u0111\u1ed9ng, chu du kh\u1eafp n\u01a1i. Du M\u1ed9c ngh\u0129a l\u00e0 cha m\u1eb9 mong con t\u00ednh t\u00ecnh ch\u1ea5t ph\u00e1c, m\u1ed9c m\u1ea1c, b\u00ecnh d\u1ecb nh\u01b0ng ham phi\u00eau du, kh\u00e1m ph\u00e1, cu\u1ed9c s\u1ed1ng th\u00fa v\u1ecb, t\u1ed1t \u0111\u1eb9p", "sex": 7}
{"first_name": "Giang M\u1ed9c", "meaning": "\"M\u1ed9c\" l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. \"Giang\" c\u00f3 ngh\u0129a l\u00e0 s\u00f4ng. \"Giang M\u1ed9c\" mang \u00fd ngh\u0129a con ch\u00e2n ch\u1ea5t, th\u1eadt th\u00e0 nh\u01b0ng t\u00e2m h\u1ed3n  tr\u00ed tu\u1ec7 r\u1ed9ng l\u1edbn, s\u1ebd tr\u00f4i xu\u00f4i theo d\u00f2ng h\u00f2a v\u00e0o bi\u1ec3n c\u1ea3 bao la, v\u1edbi \u00fd ngh\u0129a mong mu\u1ed1n con c\u00f3 m\u1ed9t t\u01b0\u01a1ng lai t\u01b0\u01a1i s\u00e1ng.", "sex": 5}
{"first_name": "H\u00e0 M\u1ed9c", "meaning": "\"M\u1ed9c\" l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. \"H\u00e0\" c\u00f3 ngh\u0129a l\u00e0 s\u00f4ng nh\u01b0ng mang h\u00ecnh \u1ea3nh m\u1ec1m m\u1ea1i, nh\u1eb9 nh\u00e0ng. \"H\u00e0 M\u1ed9c\" l\u00e0 t\u00ean th\u01b0\u1eddng \u0111\u1eb7t cho ng\u01b0\u1eddi con g\u00e1i v\u1edbi \u00fd ngh\u0129a mong cho con xinh x\u1eafn, hi\u1ec1n h\u00f2a nh\u01b0 d\u00f2ng s\u00f4ng t\u01b0\u1edbi m\u00e1t cu\u1ed9c s\u1ed1ng v\u00e0 lu\u00f4n ch\u00e2n ch\u1ea5t, th\u1eadt th\u00e0.", "sex": 5}
{"first_name": "Ho\u00e0ng M\u1ed9c", "meaning": "M\u1ed9c l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. Ho\u00e0ng l\u00e0 m\u00e0u v\u00e0ng, m\u00e0u c\u1ee7a sung t\u00fac, ph\u00fa qu\u00fd. Ho\u00e0ng M\u1ed9c ngh\u0129a l\u00e0 cha m\u1eb9 mong con hi\u1ec1n h\u1eadu, b\u00ecnh d\u1ecb, ch\u1ea5t ph\u00e1c & c\u00f3 t\u01b0\u01a1ng lai ph\u00fa qu\u00fd, t\u1ed1t \u0111\u1eb9p", "sex": 7}
{"first_name": "Kh\u1ea3 M\u1ed9c", "meaning": "M\u1ed9c l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. Kh\u1ea3 c\u00f3 ngh\u0129a l\u00e0 vui m\u1eebng, t\u1ed1t \u0111\u1eb9p, khen ng\u1ee3i t\u00e1n th\u01b0\u1edfng. Kh\u1ea3 M\u1ed9c ngh\u0129a l\u00e0 con c\u00f3 t\u00ednh t\u00ecnh ch\u1ea5t ph\u00e1c, th\u1eadt th\u00e0, m\u1ed9c m\u1ea1c b\u00ecnh d\u1ecb d\u1ec5 g\u1ea7n mang l\u1ea1i ni\u1ec1m vui, t\u1ed1t \u0111\u1eb9p cho m\u1ecdi ng\u01b0\u1eddi", "sex": 7}
{"first_name": "Ki\u1ec1u M\u1ed9c", "meaning": "\"M\u1ed9c\" l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. \"Ki\u1ec1u\" c\u00f3 ngh\u0129a l\u00e0 xinh x\u1eafn, ki\u1ec1u di\u1ec5m, \"Ki\u1ec1u M\u1ed9c\" l\u00e0 t\u00ean d\u00e0nh cho ng\u01b0\u1eddi con g\u00e1i v\u1edbi mong mu\u1ed1n con xinh \u0111\u1eb9p, ki\u1ec1u di\u1ec5m, dung m\u1ea1o \u0111oan trang thu h\u00fat v\u00e0 t\u00e2m h\u1ed3n ch\u00e2n th\u1eadt, hi\u1ec1n h\u00f2a.", "sex": 5}
{"first_name": "Kim M\u1ed9c", "meaning": "M\u1ed9c l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. Kim c\u00f3 ngh\u0129a l\u00e0 v\u00e0ng. Kim M\u1ed9c mang \u00fd ngh\u0129a con ch\u00e2n ch\u1ea5t, th\u1eadt th\u00e0, t\u00ednh t\u00ecnh b\u00ecnh d\u1ecb, m\u1ed9c m\u1ea1c \u0111\u00e1ng qu\u00fd nh\u01b0 c\u00e2y g\u1ed7 b\u1eb1ng v\u00e0ng", "sex": 7}
{"first_name": "Lam M\u1ed9c", "meaning": "M\u1ed9c l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. Lam l\u00e0 ng\u1ecdc Lam \u0111\u1ed9c \u0111\u00e1o v\u1edbi m\u00e0u s\u1eafc l\u1ea1 m\u1eaft. Lam M\u1ed9c ngh\u0129a l\u00e0 con ch\u1ea5t ph\u00e1c, th\u1eadt th\u00e0, m\u1ed9c m\u1ea1c, b\u00ecnh d\u1ecb nh\u01b0 vi\u00ean ng\u1ecdc lam ch\u01b0a qua m\u00e0i d\u0169a.", "sex": 7}
{"first_name": "L\u1ec7 M\u1ed9c", "meaning": "\"M\u1ed9c\" l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. \"L\u1ec7\" l\u00e0 l\u1ec1 l\u1ed1i quy \u0111\u1ecbnh, n\u1ec1 n\u1ebfp. \"L\u1ec7 M\u1ed9c\" mang \u00fd ngh\u0129a con s\u1ed1ng ch\u00e2n th\u1eadt, ch\u1ea5t ph\u00e1c, hi\u1ec1n h\u00f2a, c\u00f3 n\u1ec1 n\u1ebfp, quy c\u1ee7, ngoan hi\u1ec1n bi\u1ebft nghe l\u1eddi cha m\u1eb9.", "sex": 5}
{"first_name": "L\u01b0u M\u1ed9c", "meaning": "\"M\u1ed9c\" l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. \"L\u01b0u\" l\u00e0 \u00fd ch\u1ec9 d\u00f2ng h\u1ea3i l\u01b0u xu\u00f4i ra bi\u1ec3n l\u1edbn. V\u1edbi t\u00ean n\u00e0y c\u00f3 ngh\u0129a cha m\u1eb9 mong con khi \u0111\u01b0\u1ee3c d\u1ea1y d\u1ed7 u\u1ed1n n\u1eafn s\u1ebd th\u00e0nh ng\u01b0\u1eddi hi\u1ec1n t\u00e0i, t\u00e2m t\u00ednh ch\u1ea5t ph\u00e1c, th\u1eadt th\u00e0, kh\u00f4ng ganh \u0111ua, hi\u1ec1m t\u1ef5.", "sex": 3}
{"first_name": "Ph\u01b0\u01a1ng M\u1ed9c", "meaning": "M\u1ed9c l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. Ph\u01b0\u01a1ng l\u00e0 m\u00f9i th\u01a1m c\u1ee7a c\u1ecf hoa. Ph\u01b0\u01a1ng M\u1ed9c ngh\u0129a l\u00e0 con ch\u00e2n ch\u1ea5t, th\u1eadt th\u00e0, m\u1ed9c m\u1ea1c, gi\u1ea3n d\u1ecb t\u1ecfa h\u01b0\u01a1ng thanh cao, thu\u1ea7n khi\u1ebft", "sex": 7}
{"first_name": "Quang M\u1ed9c", "meaning": "\"M\u1ed9c\" l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. \"Quang\" l\u00e0 \u00e1nh s\u00e1ng t\u00ean \"Quang\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, s\u00e1ng su\u1ed1t, c\u00f3 t\u00e0i n\u0103ng. \"Quang M\u1ed9c\" mang \u00fd ngh\u0129a con th\u00f4ng minh s\u00e1ng su\u1ed1t, c\u00f3 t\u00e0i n\u0103ng, b\u1ea3n t\u00ednh ch\u00e2n ch\u1ea5t, th\u1eadt th\u00e0.", "sex": 3}
{"first_name": "S\u01b0\u01a1ng M\u1ed9c", "meaning": "\"M\u1ed9c\" l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. K\u1ebft h\u1ee3p v\u1edbi h\u00ecnh \u1ea3nh tinh kh\u00f4i thu\u1ea7n khi\u1ebft c\u1ee7a gi\u00f3t s\u01b0\u01a1ng trong bu\u1ed5i s\u1edbm mang l\u1ea1i cho t\u00ean \"S\u01b0\u01a1ng M\u1ed9c\" \u00fd ngh\u0129a con s\u1ebd l\u00e0 ng\u01b0\u1eddi nh\u1eb9 nh\u00e0ng, xinh x\u1eafn, t\u00e2m h\u1ed3n tinh khi\u1ebft, m\u1ed9c m\u1ea1c. Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, \"M\u1ed9c\" k\u1ebft h\u1ee3p c\u00f9ng b\u1ed9 c\u00e1c t\u00ean thu\u1ed9c b\u1ed9 th\u1ee7y nh\u01b0 \"S\u01b0\u01a1ng\" s\u1ebd mang \u0111\u1ebfn s\u1ef1 may m\u1eafn th\u1ecbnh v\u01b0\u1ee3ng.", "sex": 5}
{"first_name": "T\u1ea5n M\u1ed9c", "meaning": "M\u1ed9c l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. T\u1ea5n c\u00f3 ngh\u0129a l\u00e0 t\u1ea5n t\u1edbi, ph\u00e1t tri\u1ec3n ng\u00e0y m\u1ed9t t\u1ed1t \u0111\u1eb9p. T\u1ea5n M\u1ed9c ngh\u0129a l\u00e0 cha m\u1eb9 mong con c\u00f3 b\u1ea3n t\u00ednh hi\u1ec1n h\u1eadu, m\u1ed9c m\u1ea1c, b\u00ecnh d\u1ecb & t\u01b0\u01a1ng lai t\u1ed1t \u0111\u1eb9p, ph\u00e1t tri\u1ec3n, th\u0103ng ti\u1ebfn ng\u00e0y c\u00e0ng v\u1ebb vang", "sex": 7}
{"first_name": "Thanh M\u1ed9c", "meaning": "M\u1ed9c l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. Thanh l\u00e0 thanh cao, thu\u1ea7n khi\u1ebft. Thanh M\u1ed9c ngh\u0129a l\u00e0 cha m\u1eb9 mong con t\u00ednh t\u00ecnh hi\u1ec1n h\u1eadu, thu\u1ea7n khi\u1ebft, trong s\u00e1ng, s\u1ed1ng ch\u00e2n th\u1eadt, \u0111\u01a1n gi\u1ea3n, b\u00ecnh d\u1ecb", "sex": 7}
{"first_name": "Th\u1ea3o M\u1ed9c", "meaning": "\"Th\u1ea3o M\u1ed9c\" ngh\u0129a l\u00e0 c\u00e2y c\u1ecf, c\u00e1c lo\u1ea1i th\u1ef1c v\u1eadt n\u00f3i chung. T\u00ean \"Th\u1ea3o M\u1ed9c\" mang \u00fd ngh\u0129a con m\u1ec1m m\u1ea1i, nh\u1eb9 nh\u00e0ng nh\u01b0ng l\u1ea1i ti\u1ec1m \u1ea9n s\u1ee9c s\u1ed1ng m\u00e3nh li\u1ec7t, b\u1ec1n b\u1ec9.", "sex": 5}
{"first_name": "Thi\u00ean M\u1ed9c", "meaning": "M\u1ed9c l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. Thi\u00ean l\u00e0 tr\u1eddi, mang \u00fd ngh\u0129a bao la, r\u1ed9ng l\u1edbn. Thi\u00ean M\u1ed9c ngh\u0129a l\u00e0 cha m\u1eb9 mong con c\u00f3 cu\u1ed9c s\u1ed1ng an nh\u00e0n, b\u00ecnh d\u1ecb, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, h\u1ed3n h\u1eadu, m\u1ed9c m\u1ea1c g\u1ea7n g\u0169i & t\u1ea7m nh\u00ecn cao r\u1ed9ng, kh\u00f4ng ganh \u0111ua, bon chen", "sex": 7}
{"first_name": "Thi\u1ec7u M\u1ed9c", "meaning": "M\u1ed9c l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. Thi\u1ec7u c\u00f3 ngh\u0129a l\u00e0 t\u1ed1t \u0111\u1eb9p, cao th\u01b0\u1ee3ng. Thi\u1ec7u M\u1ed9c ngh\u0129a l\u00e0 con c\u00f3 b\u1ea3n t\u00ednh t\u1ed1t \u0111\u1eb9p, cao th\u01b0\u1ee3ng m\u00e0 m\u1ed9c m\u1ea1c, ch\u00e2n th\u00e0nh, l\u00e0 ng\u01b0\u1eddi b\u00ecnh d\u1ecb, h\u1ed3n h\u1eadu", "sex": 7}
{"first_name": "Thu\u1eadn M\u1ed9c", "meaning": "M\u1ed9c l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. Thu\u1eadn c\u00f3 ngh\u0129a l\u00e0 h\u00f2a thu\u1eadn, hi\u1ebfu thu\u1eadn. Thu\u1eadn M\u1ed9c ngh\u0129a l\u00e0 cha m\u1eb9 mong con c\u00f3 cu\u1ed9c s\u1ed1ng an nh\u00e0n, t\u00e2m t\u00ednh b\u00ecnh d\u1ecb, m\u1ed9c m\u1ea1c, ch\u1ea5t ph\u00e1c, lu\u00f4n g\u1eb7p m\u1ecdi chuy\u1ec7n thu\u1eadn bu\u1ed3m xu\u00f4i gi\u00f3", "sex": 7}
{"first_name": "Th\u1ee7y M\u1ed9c", "meaning": "\"M\u1ed9c\" l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. \"Th\u1ee7y\" l\u00e0 n\u01b0\u1edbc \u00fd n\u00f3i s\u1ef1 m\u1ec1m m\u1ea1i nh\u1eb9 nh\u00e0ng c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. V\u1edbi t\u00ean \"Th\u1ee7y M\u1ed9c\", ba m\u1eb9 mong xinh x\u1eafn, hi\u1ec1n h\u00f2a, ch\u00e2n ch\u1ea5t, th\u1eadt th\u00e0.", "sex": 5}
