{"first_name": "Tr\u1ecdng M\u1ed9c", "meaning": "\"M\u1ed9c\" l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. Tr\u1ecdng l\u00e0 th\u1ec3 hi\u1ec7n s\u1ef1 k\u00ednh n\u1ec3, bi\u1ebft ghi kh\u1eafc nh\u1eefng t\u00ecnh c\u1ea3m v\u00e0 c\u00f4ng lao to l\u1edbn c\u1ee7a ng\u01b0\u1eddi kh\u00e1c d\u00e0nh cho m\u00ecnh. \"Tr\u1ecdng M\u1ed9c\" mang \u00fd ngh\u0129a con bi\u1ebft s\u1ed1ng ch\u00e2n th\u1eadt, b\u00ecnh d\u1ecb, hi\u1ec1n h\u00f2a, bi\u1ebft k\u00ednh tr\u1ecdng cha m\u1eb9, \u00f4ng b\u00e0.", "sex": 3}
