{"first_name": "Th\u1ee5c V\u00e2n", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"Th\u1ee5c\" c\u00f3 ngh\u0129a l\u00e0 th\u00e0nh th\u1ea1o, thu\u1ea7n th\u1ee5c, n\u00f3i v\u1ec1 nh\u1eefng th\u1ee9 \u0111\u00e3 quen thu\u1ed9c, n\u00f3i v\u1ec1 s\u1ef1 tinh t\u01b0\u1eddng, t\u1ec9 m\u1ec9. T\u00ean \"Th\u1ee5c\" l\u00e0 c\u00e1i t\u00ean kh\u00e1 gi\u1ea3n d\u1ecb \u0111\u01b0\u1ee3c \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i nh\u1eb1m mong \u01b0\u1edbc con c\u00f3 \u0111\u01b0\u1ee3c t\u00ednh ki\u00ean c\u01b0\u1eddng, ch\u0103m ch\u1ec9, tinh t\u1ebf, l\u00e0m g\u00ec c\u0169ng ch\u00fa t\u00e2m ho\u00e0n th\u00e0nh t\u1ed1t. \"Th\u1ee5c V\u00e2n\" l\u00e0 ng\u01b0\u1eddi con g\u00e1i nh\u1eb9 nh\u00e0ng, tinh t\u1ebf, t\u1ec9 m\u1ec9", "sex": 5}
{"first_name": "Th\u00fay V\u00e2n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn vi\u00ean ng\u1ecdc \u0111\u1eb9p, ng\u1ecdc qu\u00fd.  \"Th\u00fay\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd lu\u00f4n xinh \u0111\u1eb9p, quy\u1ec1n qu\u00fd, \u0111\u01b0\u1ee3c tr\u00e2n tr\u1ecdng v\u00e0 n\u00e2ng niu. \"Th\u00fay V\u00e2n\" l\u00e0 ng\u01b0\u1eddi con g\u00e1i nh\u1eb9 nh\u00e0ng nh\u01b0 \u00e1ng m\u00e2y, xinh \u0111\u1eb9p, quy\u1ec1n qu\u00fd.", "sex": 5}
{"first_name": "Th\u00f9y V\u00e2n", "meaning": "Th\u00f9y V\u00e2n l\u00e0 t\u00ean m\u1ed9t v\u00f9ng bi\u1ec3n \u0111\u1eb9p, \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi bi\u1ebft \u0111\u1ebfn v\u1edbi t\u00ean g\u1ecdi M\u00e2y tr\u1eafng hay M\u00e2y phi\u00eau b\u1ed3ng. T\u00ean Th\u00f9y V\u00e2n th\u1ec3 hi\u1ec7n con l\u00e0 ng\u01b0\u1eddi nh\u1eb9 nh\u00e0ng, y\u00eau \u0111\u1eddi, xinh \u0111\u1eb9p, c\u1ea3 \u0111\u1eddi an nh\u00e0n, t\u1ef1 t\u1ea1i", "sex": 5}
{"first_name": "Th\u1ee5y V\u00e2n", "meaning": "Theo ti\u1ebfng H\u00e1n, \"Th\u1ee5y\" l\u00e0 t\u00ean chung c\u1ee7a ng\u1ecdc khu\u00ea ng\u1ecdc b\u00edch, \u0111\u1eddi x\u01b0a d\u00f9ng ng\u1ecdc \u0111\u1ec3 l\u00e0m tin. T\u00ean \"Th\u1ee5y\" th\u1ec3 hi\u1ec7n \u0111\u01b0\u1ee3c s\u1ef1 thanh cao, qu\u00fd ph\u00e1i. T\u00ean \"Th\u1ee5y\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd xinh \u0111\u1eb9p, sang tr\u1ecdng, cu\u1ed9c s\u1ed1ng sung t\u00fac, vinh hoa. Ngo\u00e0i ra, \"Th\u1ee5y\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 \u0111i\u1ec1m l\u00e0nh, mong mu\u1ed1n cu\u1ed9c s\u1ed1ng b\u00ecnh an, may m\u1eafn, g\u1eb7p \u0111\u01b0\u1ee3c nhi\u1ec1u \u0111i\u1ec1u t\u1ed1t l\u00e0nh. \"Th\u1ee5y V\u00e2n\" l\u00e0 \u0111\u00e1m m\u00e2y nh\u1ecf, thanh cao, qu\u00fd ph\u00e1i, nh\u1eb9 nh\u00e0ng.", "sex": 5}
{"first_name": "Tr\u00e0 V\u00e2n", "meaning": "\"V\u00e2n\" theo ngh\u0129a H\u00e1n-Vi\u1ec7t l\u00e0 m\u00e2y, g\u1ee3i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0 \u0111\u00e1m m\u00e2y tr\u1eafng b\u1ed3ng b\u1ec1nh tr\u00ean tr\u1eddi. Trong m\u1ed9t s\u1ed1 t\u00e1c ph\u1ea9m v\u0103n h\u1ecdc th\u01b0\u1eddng d\u00f9ng, \"V\u00e2n\" l\u00e0 kh\u00f3i, l\u1ea5y \"V\u00e2n\" \u0111\u1ec3 h\u00ecnh dung ra m\u1ed9t m\u1ef9 c\u1ea3nh thi\u00ean nhi\u00ean t\u01b0\u01a1i \u0111\u1eb9p. T\u00ean \"Tr\u00e0 V\u00e2n\" g\u1ee3i \u0111\u1ebfn c\u1ea3nh v\u1eadt thi\u00ean nhi\u00ean t\u01b0\u01a1i \u0111\u1eb9p, n\u00ean th\u01a1, m\u1ea5y tr\u1eafng tr\u00f4i b\u1ec1nh b\u1ed3ng tr\u00ean c\u00e1nh \u0111\u1ed3ng tr\u00e0 xanh ng\u00e1t, th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi xinh \u0111\u1eb9p, duy d\u00e1ng, c\u00f3 cu\u1ed9c s\u1ed1ng an nh\u00e0n, b\u00ecnh y\u00ean.", "sex": 5}
