{"first_name": "Tr\u00fac V\u00e2n", "meaning": "T\u00ean \"Tr\u00fac\" l\u1ea5y h\u00ecnh \u1ea3nh t\u1eeb c\u00e2y tr\u00fac, m\u1ed9t lo\u00e0i c\u00e2y quen thu\u1ed9c v\u1edbi cu\u1ed9c s\u1ed1ng \u0111\u00e3 tr\u1edf th\u00e0nh m\u1ed9t bi\u1ec3u t\u01b0\u1ee3ng cho kh\u00ed ch\u1ea5t thanh cao c\u1ee7a ng\u01b0\u1eddi Vi\u1ec7t, \"Tr\u00fac\" l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a ng\u01b0\u1eddi qu\u00e2n t\u1eed b\u1edfi lo\u1ea1i c\u00e2y n\u00e0y tuy c\u1ee9ng m\u00e0 v\u1eabn m\u1ec1m m\u1ea1i, \u0111\u1ed5 m\u00e0 kh\u00f4ng g\u00e3y, r\u1ed7ng ru\u1ed9t nh\u01b0 t\u00e2m h\u1ed3n an nhi\u00ean, t\u1ef1 t\u1ea1i, kh\u00f4ng ch\u1ea1y theo quy\u1ec1n v\u1ecb, v\u1eadt ch\u1ea5t.  K\u1ebft h\u1ee3p v\u1edbi t\u1eeb \"V\u00e2n\" ngh\u0129a l\u00e0 \u00e1ng m\u00e2y nh\u1eb9 nh\u00e0ng. \"Tr\u00fac V\u00e2n\" l\u00e0 ng\u01b0\u1eddi con g\u00e1i v\u1eeba nh\u1eb9 nh\u00e0ng, xinh \u0111\u1eb9p d\u1ecbu d\u00e0ng, v\u1eeba c\u00f3 kh\u00ed ch\u1ea5t thanh cao nh\u01b0 ng\u01b0\u1eddi qu\u00e2n t\u1eed.", "sex": 5}
