{"first_name": "\u00day V\u00e2n", "meaning": "\"\u00day V\u00e2n\" l\u00e0 s\u1ef1 k\u1ebft h\u1ee3p t\u00ean kh\u00e1 \u0111\u1ed9c \u0111\u00e1o c\u00f3 th\u1ec3 \u0111\u1eb7t cho c\u1ea3 nam l\u1eabn n\u1eef. Trong \u0111\u00f3, \"V\u00e2n\" theo ngh\u0129a H\u00e1n vi\u1ec7t l\u00e0 m\u00e2y, g\u1ee3i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0 \u0111\u00e1m m\u00e2y tr\u1eafng b\u1ed3ng b\u1ec1nh tr\u00ean tr\u1eddi. Trong m\u1ed9t s\u1ed1 t\u00e1c ph\u1ea9m v\u0103n h\u1ecdc th\u01b0\u1eddng d\u00f9ng \"V\u00e2n\" l\u00e0 kh\u00f3i, l\u1ea5y \"V\u00e2n\" \u0111\u1ec3 h\u00ecnh dung ra m\u1ed9t m\u1ef9 c\u1ea3nh thi\u00ean nhi\u00ean t\u01b0\u01a1i \u0111\u1eb9p.  \"\u00day\" c\u00f3 ngh\u0129a l\u00e0 an \u1ee7i v\u1ed7 v\u1ec1, k\u00ednh ph\u1ee5c, n\u1ec3 ph\u1ee5c.", "sex": 7}
