{"first_name": "H\u1ed3ng B\u00e0ng", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"H\u1ed3ng\" l\u00e0 \u00fd ch\u1ec9 m\u00e0u \u0111\u1ecf, m\u00e0 m\u00e0u \u0111\u1ecf v\u1ed1n th\u1ec3 hi\u1ec7n cho ni\u1ec1m vui, s\u1ef1 may m\u1eafn, c\u00e1t t\u01b0\u1eddng. \"B\u00e0ng\" c\u00f3 ngh\u0129a l\u1edbn lao, d\u00e0y da\u0323n hay c\u00f2n c\u00f3 ngh\u0129a th\u1ecbnh v\u01b0\u1ee3ng. \"H\u1ed3ng B\u00e0ng\" c\u00f3 ngh\u0129a l\u00e0 con chim l\u1edbn, s\u1ea3i c\u00e1nh d\u00e0i v\u00e0 \u0111\u00e2y c\u0169ng l\u00e0 d\u00f2ng h\u1ecd vua \u0111\u1ea7u ti\u00ean c\u1ee7a n\u01b0\u1edbc ta. D\u00f9ng \u0111\u1eb7t t\u00ean cho con, b\u1ed1 m\u1eb9 ng\u1ee5 \u00fd r\u1eb1ng sau n\u00e0y con s\u1ebd c\u00f3 cu\u1ed9c s\u1ed1ng v\u01b0\u01a1ng gi\u1ea3, sung t\u00fac.", "sex": 3}
{"first_name": "H\u1eefu B\u00e0ng", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, \"H\u1eefu\" c\u00f3 nhi\u1ec1u \u00fd ngh\u0129a, tuy nhi\u00ean trong \u0111\u00f3 ngh\u0129a th\u01b0\u1eddng d\u00f9ng l\u00e0 c\u00f3, s\u1edf h\u1eefu. K\u1ebft h\u1ee3p c\u00f9ng \"B\u00e0ng\" c\u00f3 ngh\u0129a l\u1edbn lao, d\u00e0y da\u0323n hay c\u00f2n c\u00f3 ngh\u0129a th\u1ecbnh v\u01b0\u1ee3ng. B\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean 'H\u1eefu B\u00e0ng\" cho con v\u1edbi hi v\u1ecdng r\u1eb1ng con s\u1ebd c\u00f3 cu\u1ed9c s\u1ed1ng gi\u00e0u sang, ph\u00fa qu\u00fd sau n\u00e0y.", "sex": 3}
{"first_name": "Kh\u00e1nh B\u00e0ng", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Kh\u00e1nh\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng s\u1ef1 vi\u1ec7c vui m\u1eebng, mang c\u1ea3m gi\u00e1c h\u00e2n hoan. \"B\u00e0ng\" c\u00f3 ngh\u0129a l\u1edbn lao, d\u00e0y da\u0323n hay c\u00f2n c\u00f3 ngh\u0129a th\u1ecbnh v\u01b0\u1ee3ng. T\u00ean \"Kh\u00e1nh B\u00e0ng\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi \u0111\u1ee9c h\u1ea1nh, t\u1ed1t \u0111\u1eb9p, mang l\u1ea1i c\u1ea3m gi\u00e1c vui t\u01b0\u01a1i, hoan h\u1ec9 cho nh\u1eefng ng\u01b0\u1eddi xung quanh.", "sex": 3}
{"first_name": "L\u00e2m B\u00e0ng", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"L\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 r\u1eebng, m\u1ed9t ngu\u1ed3n t\u00e0i nguy\u00ean qu\u00fd c\u00f3 gi\u00e1 tr\u1ecb to l\u1edbn v\u1edbi \u0111\u1eddi s\u1ed1ng. \"B\u00e0ng\" c\u00f3 ngh\u0129a l\u1edbn lao, d\u00e0y da\u0323n, hay c\u00f2n c\u00f3 ngh\u0129a th\u1ecbnh v\u01b0\u1ee3ng. T\u1ef1a nh\u01b0 t\u00ednh ch\u1ea5t c\u1ee7a r\u1eebng, t\u00ean \"L\u00e2m B\u00e0ng\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi b\u00ecnh d\u1ecb, d\u1ec5 g\u1ea7n nh\u01b0 l\u1ebd t\u1ef1 nhi\u00ean nh\u01b0ng c\u0169ng m\u1ea1nh m\u1ebd & \u0111\u1ea7y uy l\u1ef1c.", "sex": 3}
{"first_name": "M\u1ea1nh B\u00e0ng", "meaning": "\"M\u1ea1nh\" trong t\u1eeb \u0111i\u1ec3n Vi\u00ea\u0323t, \u0111\u01b0\u1ee3c d\u1ecbch l\u00e0 kh\u1ecfe kho\u1eafn, m\u1ea1nh m\u1ebd, t\u1eeb ch\u1ec9 v\u1ec1 v\u00f3c d\u00e1ng & s\u1ee9c l\u1ef1c c\u1ee7a con ng\u01b0\u1eddi. \"B\u00e0ng\" c\u00f3 ngh\u0129a l\u1edbn lao, d\u00e0y da\u0323n hay c\u00f2n c\u00f3 ngh\u0129a th\u1ecbnh v\u01b0\u1ee3ng. T\u00ean \"M\u1ea1nh B\u00e0ng\" c\u00f3 ngh\u0129a cha m\u1eb9 mong con tr\u1edf th\u00e0nh ng\u01b0\u1eddi kh\u1ecfe m\u1ea1nh, s\u1ee9c kh\u1ecfe t\u1ed1t, \u00edt b\u1ec7nh t\u1eadt, s\u1ed1ng m\u1ea1nh m\u1ebd, ki\u00ean c\u01b0\u1eddng.", "sex": 3}
{"first_name": "Minh B\u00e0ng", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, Minh c\u00f2n c\u00f3 ngh\u0129a ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (b\u00ecnh minh), th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. B\u00ean c\u1ea1nh \u0111\u00f3, \"B\u00e0ng\" c\u00f3 ngh\u0129a l\u1edbn lao, d\u00e0y da\u0323n hay c\u00f2n c\u00f3 ngh\u0129a th\u1ecbnh v\u01b0\u1ee3ng", "sex": 3}
{"first_name": "Ng\u1ecdc B\u00e0ng", "meaning": "\"Ng\u1ecdc\" theo ti\u1ebfng H\u00e1n - Vi\u00ea\u0323t, l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh... th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed. T\u00ean Ng\u1ecdc th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u1ecfa s\u00e1ng nh\u01b0 h\u00f2n ng\u1ecdc qu\u00fd, mang \u00fd ngh\u0129a l\u00e0 tr\u00e2n b\u1ea3o, l\u00e0 m\u00f3n qu\u00e0 qu\u00fd gi\u00e1 c\u1ee7a t\u1ea1o h\u00f3a.", "sex": 7}
