{"first_name": "Ph\u01b0\u01a1ng B\u00e0ng", "meaning": "Ch\u1eef \"Ph\u01b0\u01a1ng\" theo ngh\u0129a H\u00e1n - Vi\u00ea\u0323t d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi bi\u1ebft \u0111\u1ea1o l\u00fd l\u00e0m ng\u01b0\u1eddi, bi\u1ebft ph\u00e2n bi\u1ec7t t\u1ed1t x\u1ea5u, \u0111\u00fang sai. Th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi s\u00e1ng su\u1ed1t, tr\u00ed tu\u1ec7. \"B\u00e0ng\" c\u00f3 ngh\u0129a l\u1edbn lao, d\u00e0y da\u0323n hay c\u00f2n c\u00f3 ngh\u0129a th\u1ecbnh v\u01b0\u1ee3ng. T\u00ean \"Ph\u01b0\u01a1ng B\u00e0ng\" l\u00e0 mong mu\u1ed1n c\u1ee7a cha m\u1eb9 mu\u1ed1n con m\u00ecnh lu\u00f4n l\u00e0m nh\u1eefng \u0111i\u1ec1u t\u1ed1t, bi\u1ebft c\u00e1ch \u0111\u1ed1i nh\u00e2n x\u1eed th\u1ebf, l\u00e0m cha m\u1eb9 y\u00ean l\u00f2ng.", "sex": 7}
{"first_name": "Th\u00e1i B\u00e0ng", "meaning": "\"Th\u00e1i\" theo ngh\u0129a H\u00e1n - Vi\u00ea\u0323t c\u00f3 ngh\u0129a l\u00e0 hanh th\u00f4ng, thu\u1eadn l\u1ee3i, ch\u1ec9 s\u1ef1 y\u00ean vui, b\u00ecnh y\u00ean, th\u01b0 th\u00e1i. \u0110\u1eb7t con t\u00ean \"Th\u00e1i\" l\u00e0 mong con c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean vui v\u1ebb, t\u00e2m h\u1ed3n l\u1ea1c quan, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean.", "sex": 3}
{"first_name": "Thanh B\u00e0ng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 m\u00e0u xanh, tu\u1ed5i tr\u1ebb, c\u00f2n l\u00e0 s\u1ef1 thanh cao, trong s\u1ea1ch, thanh b\u1ea1ch. \"B\u00e0ng\" c\u00f3 ngh\u0129a l\u1edbn lao, d\u00e0y da\u0323n hay c\u00f2n c\u00f3 ngh\u0129a th\u1ecbnh v\u01b0\u1ee3ng. Ng\u01b0\u1eddi t\u00ean \"Thanh\" th\u01b0\u1eddng c\u00f3 kh\u00ed ch\u1ea5t \u0111i\u1ec1m \u0111\u1ea1m, nh\u1eb9 nh\u00e0ng v\u00e0 cao qu\u00fd.", "sex": 3}
{"first_name": "Th\u1ebf B\u00e0ng", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"Th\u1ebf\" c\u00f3 ngh\u0129a l\u00e0 quy\u1ec1n l\u1ef1c, s\u1ee9c m\u1ea1nh, uy l\u1ef1c. \"B\u00e0ng\" c\u00f3 ngh\u0129a l\u1edbn lao, d\u00e0y da\u0323n hay c\u00f2n c\u00f3 ngh\u0129a th\u1ecbnh v\u01b0\u1ee3ng. T\u00ean \"Th\u1ebf B\u00e0ng\" th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi kh\u1ecfe m\u1ea1nh, uy nghi, t\u00e0i gi\u1ecfi v\u00e0 c\u00f3 quy\u1ec1n l\u1ef1c trong tay.", "sex": 3}
{"first_name": "Thi\u00ean B\u00e0ng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u00ea\u0323t, \"Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eddi, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. \"B\u00e0ng\" c\u00f3 ngh\u0129a l\u1edbn lao, d\u00e0y da\u0323n hay c\u00f2n c\u00f3 ngh\u0129a th\u1ecbnh v\u01b0\u1ee3ng. T\u1ef1a nh\u01b0 b\u1ea7u tr\u1eddi bao la \u1ea5y, ng\u01b0\u1eddi t\u00ean \"Thi\u00ean B\u00e0ng\" th\u01b0\u1eddng \u0111\u0129nh \u0111\u1ea1c, lu\u00f4n m\u1ea1nh m\u1ebd, c\u00f3 c\u00e1i nh\u00ecn bao qu\u00e1t, t\u1ea7m nh\u00ecn r\u1ed9ng l\u1edbn.", "sex": 3}
{"first_name": "Vi\u00ea\u0323t, B\u00e0ng", "meaning": "T\u00ean Vi\u00ea\u0323t, xu\u1ea5t ph\u00e1t t\u1eeb t\u00ean c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, c\u0169ng c\u00f3 n\u00e9t ngh\u0129a ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi th\u00f4ng minh, \u01b0u vi\u1ec7t. \"B\u00e0ng\" c\u00f3 ngh\u0129a l\u1edbn lao, d\u00e0y da\u0323n hay c\u00f2n c\u00f3 ngh\u0129a th\u1ecbnh v\u01b0\u1ee3ng. V\u00ec v\u1eady, \u0111\u1eb7t t\u00ean \"Vi\u00ea\u0323t B\u00e0ng\" cho con, b\u1ed1 m\u1eb9 mong mu\u1ed1n r\u1eb1ng con s\u1ebd l\u00e0 ng\u01b0\u1eddi \u0111\u0129nh \u0111\u1ea1c, c\u00f3 b\u1ea3n l\u0129nh, l\u00e0m n\u00ean c\u01a1 nghi\u1ec7p l\u1edbn v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng gi\u00e0u sang, sung t\u00fac.", "sex": 3}
{"first_name": "V\u0129nh B\u00e0ng", "meaning": "T\u00ean V\u0129nh mang \u00fd ngh\u0129a tr\u01b0\u1eddng t\u1ed3n, v\u0129nh vi\u1ec5n. \"B\u00e0ng\" c\u00f3 ngh\u0129a l\u1edbn lao, d\u00e0y da\u0323n hay c\u00f2n c\u00f3 ngh\u0129a th\u1ecbnh v\u01b0\u1ee3ng. \u0110\u1eb7t t\u00ean \"V\u0129nh B\u00e0ng\" cho con, b\u1ed1 m\u1eb9 hi v\u1ecdng r\u1eb1ng con s\u1ebd c\u00f3 cu\u1ed9c s\u1ed1ng ph\u1ed3n vinh, tr\u00e1ng th\u1ecbnh m\u00e3i m\u00e3i.", "sex": 3}
