{"first_name": "D\u01b0\u1ee1ng Minh", "meaning": "Minh l\u00e0 s\u00e1ng s\u1ee7a. Minh D\u01b0\u1ee1ng \u0111\u01b0\u1ee3c hi\u1ec3u l\u00e0 mang l\u1ea1i ngu\u1ed3n s\u1ed1ng t\u01b0\u01a1i \u0111\u1eb9p, nh\u01b0 l\u00f2ng cha m\u1eb9 y\u00eau th\u01b0\u01a1ng, xem con nh\u01b0 ngu\u1ed3n s\u1ed1ng", "sex": 3}
{"first_name": "Duy Minh", "meaning": "\"Duy Minh l\u00e0 m\u1ed9t c\u00e1i t\u00ean hay d\u00e0nh cho c\u00e1c b\u00e9 trai.\r\n+ \"\"Duy\"\": l\u00e0 t\u01b0 duy suy ngh\u0129, s\u1ef1 gi\u1eef g\u00ecn, duy tr\u00ec, s\u1ef1 duy nh\u1ea5t....\r\n+ \"\"Minh\"\": th\u00f4ng minh, s\u00e1ng su\u1ed1t, r\u00f5 r\u00e0ng, minh b\u1ea1ch, s\u00e1ng t\u1ecf...\r\n=> t\u00ean Duy Minh c\u00f3 ngh\u0129a l\u00e0 con lu\u00f4n c\u00f3 t\u01b0 duy minh b\u1ea1ch, h\u1ecdc h\u00e0nh th\u00f4ng minh s\u00e1ng su\u1ed1t \u0111\u1ec3 c\u00f3 t\u01b0\u01a1ng lai xa\u0301n la\u0323n...\"", "sex": 3}
{"first_name": "Duy\u00ean Minh", "meaning": "Mong mu\u1ed1n con th\u00f4ng minh lanh l\u1ee3i duy\u00ean d\u00e1ng trong m\u1eaft m\u1ecdi ng\u01b0\u1eddi.", "sex": 5}
