{"first_name": "H\u1ea3i Minh", "meaning": "\"H\u1ea3i: n\u01b0\u1edbc, \u0111\u1ea1i d\u01b0\u01a1ng.\r\nMinh: th\u00f4ng minh, chi\u1ebfu s\u00e1ng.\r\nT\u00ean H\u1ea3i Minh v\u1edbi \u00fd mu\u1ed1n l\u1edbn l\u00ean con s\u1ebd kh\u00e1m ph\u00e1 th\u1ebf gi\u1edbi b\u1eb1ng s\u1ef1 th\u00f4ng minh c\u1ee7a m\u00ecnh.\"", "sex": 3}
{"first_name": "H\u1eb1ng Minh", "meaning": "\"H\u1eb1ng\" l\u00e0 s\u1ef1 v\u1eefng b\u1ec1n, m\u00e3i m\u00e3i. \"Minh\" l\u00e0 \u00e1nh s\u00e1ng, th\u00f4ng minh. \"H\u1eb1ng Minh\" mang \u00fd ngh\u0129a con lu\u00f4n th\u00f4ng minh, s\u00e1ng su\u1ed1t trong c\u1ea3 cu\u1ed9c \u0111\u1eddi.", "sex": 3}
{"first_name": "H\u1ea1nh Minh", "meaning": "\"H\u1ea1nh\": \u0111\u1ee9c h\u1ea1nh, ti\u1ebft h\u1ea1nh - \u0111\u1ea1o \u0111\u1ee9c v\u00e0 t\u00ednh n\u1ebft t\u1ed1t (th\u01b0\u1eddng n\u00f3i v\u1ec1 ph\u1ee5 n\u1eef) Minh\": th\u00f4ng minh, s\u00e1ng t\u1ecf, minh b\u1ea1ch, s\u00e1ng su\u1ed1t....t\u1eeb n\u00e0y c\u0169ng c\u00f3 \u00fd ngh\u0129a \u00e1m ch\u1ec9 v\u1ec1 t\u01b0\u01a1ng lai. \"H\u1ea1nh Minh\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean mang \u00fd ngh\u0129a mong con s\u1ebd lu\u00f4n l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh, s\u00e1ng su\u1ed1t v\u00e0 c\u00f3 \u0111\u1ee9c h\u1ea1nh.", "sex": 5}
{"first_name": "H\u00e0o Minh", "meaning": "\"H\u00e0o\" l\u00e0 ng\u01b0\u1eddi c\u00f3 t\u00e0i, ph\u00f3ng kho\u00e1ng (h\u00e0o ki\u1ec7t), l\u00e0 s\u1ef1 h\u00e3nh di\u1ec7n t\u1ef1 h\u00e0o. \"Minh\" l\u00e0 s\u00e1ng, th\u00f4ng minh, s\u00e1ng su\u1ed1t, minh m\u1eabn, t\u00ean \"H\u00e0o Minh\" mang \u00fd ngh\u0129a mong t\u01b0\u01a1ng lai con s\u1ebd tr\u1edf th\u00e0nh ng\u01b0\u1eddi th\u00f4ng minh t\u00e0i gi\u1ecfi v\u00e0 l\u00e0 ni\u1ec1m t\u1ef1 h\u00e0o h\u00e3nh di\u1ec7n c\u1ee7a c\u1ea3 gia \u0111\u00ecnh.", "sex": 3}
