{"first_name": "Hi\u1ec3n Minh", "meaning": "\"Hi\u1ec3n\" l\u00e0 gi\u00e0u c\u00f3, vinh hi\u1ec3n, t\u01b0\u01a1ng lai s\u00e1ng l\u1ea1ng. \"Minh\" l\u00e0 th\u00f4ng minh, s\u00e1ng su\u1ed1t hay c\u00f2n hi\u1ec3u l\u00e0 \u00e1nh s\u00e1ng. \"Hi\u1ec3n Minh\" mang \u00fd ngh\u0129a t\u01b0\u01a1ng lai con s\u1ebd vinh hi\u1ec3n, s\u00e1ng l\u1ea1ng \u0111\u1ea7y \u0111\u1ee7, sung t\u00fac.", "sex": 3}
{"first_name": "Hi\u1ebfu Minh", "meaning": "\"Hi\u1ebfu Minh l\u00e0 t\u00ean th\u01b0\u1eddng \u0111\u1eb7t cho c\u00e1c b\u00e9 trai\r\n+ \"\"Hi\u1ebfu\"\": hi\u1ebfu th\u1ea3o, \u0111\u1ed1i x\u1eed t\u1ed1t v\u1edbi nh\u1eefng ng\u01b0\u1eddi \u0111\u00e3 c\u00f3 c\u00f4ng \u01a1n sinh th\u00e0nh ra m\u00ecnh.\r\n+ \"\"Minh\"\": th\u00f4ng minh, s\u00e1ng su\u1ed1t, s\u00e1ng t\u1ecf, minh m\u1eabn, r\u00f5 r\u00e0ng...\r\n=> T\u00ean \"\"Hi\u1ebfu Minh\"\" c\u00f3 ngh\u0129a l\u00e0 \"\"hi\u1ebfu th\u1ea3o v\u00e0 th\u00f4ng minh\"\", \u0111\u00e2y l\u00e0 nh\u1eefng \u0111\u1ee9c t\u00ednh m\u00e0 cha m\u1eb9 lu\u00f4n mong mu\u1ed1n con c\u00e1i m\u00ecnh c\u00f3 \u0111\u01b0\u1ee3c.\"", "sex": 3}
{"first_name": "Ho\u00e0ng Minh", "meaning": "\"Ho\u00e0ng l\u00e0 m\u00e0u v\u00e0ng, ho\u1eb7c danh t\u1eeb ch\u1ec9 vua ch\u00faa.\r\nMinh: a\u0301nh s\u00e1ng, s\u1ef1 th\u00f4ng minh, s\u00e1ng su\u1ed1t.\r\nHo\u00e0ng Minh c\u00f3 ngh\u0129a l\u00e0 \"\" \u00e1nh s\u00e1ng m\u00e0u v\u00e0ng r\u1ef1c r\u1ee1\"\", \u00fd n\u00f3i con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p, t\u1ecfa s\u00e1ng thu h\u00fat (ngh\u0129a n\u00e0y \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho b\u00e9 g\u00e1i) ho\u1eb7c \"\"v\u1ecb vua anh minh s\u00e1ng su\u1ed1t\"\", \u00fd so s\u00e1nh con c\u00f3 tr\u00ed tu\u1ec7 & c\u1ed1t c\u00e1ch nh\u01b0 b\u1eadc vua ch\u00faa (\u0111\u1eb7t t\u00ean cho b\u00e9 trai).\"", "sex": 3}
{"first_name": "H\u1ed3ng Minh", "meaning": "Minh ngh\u0129a l\u00e0 th\u00f4ng minh t\u00e0i tr\u00ed hay c\u00f2n c\u00f3 ngh\u0129a l\u00e0 b\u1eaft \u0111\u1ea7u nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. H\u1ed3ng l\u00e0 m\u00e0u \u0111\u1ecf, m\u00e0u c\u1ee7a may m\u1eafn, c\u00e1t t\u01b0\u1eddng. H\u1ed3ng Minh ngh\u0129a l\u00e0 con th\u00f4ng minh, s\u00e1ng d\u1ea1, lu\u00f4n g\u1eb7p may m\u1eafn, h\u1ea1nh ph\u00fac", "sex": 7}
{"first_name": "Hu\u1ebf Minh", "meaning": "\"Minh\" trong ti\u1ebfng H\u00e1n c\u00f3 ngh\u0129a l\u00e0 s\u00e1ng l\u1ea1ng. \"Hu\u1ebf\" l\u00e0 m\u1ed9t \u0111\u1ecba danh n\u1ed5i ti\u1ebfng \u1edf Vi\u1ec7t Nam, \u0111\u01b0\u1ee3c bi\u1ebft \u0111\u1ebfn nh\u01b0 c\u1ed1 \u0111\u00f4 c\u00f3 v\u1ebb \u0111\u1eb9p d\u1ecbu d\u00e0ng c\u1ee7a s\u00f4ng H\u01b0\u01a1ng, c\u00f3 v\u1ebb \u0111\u1eb9p tr\u1ea7m c\u1ed5 c\u1ee7a ho\u00e0ng th\u00e0nh x\u01b0a. \"Hu\u1ebf Minh\" l\u00e0 c\u00e1i t\u00ean r\u1ea5t d\u1ecbu d\u00e0ng d\u00e0nh cho con g\u00e1i.", "sex": 5}
{"first_name": "H\u1eefu Minh", "meaning": "Minh ngh\u0129a l\u00e0 th\u00f4ng minh t\u00e0i tr\u00ed hay c\u00f2n c\u00f3 ngh\u0129a l\u00e0 b\u1eaft \u0111\u1ea7u nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. H\u1eefu l\u00e0 c\u00f3, l\u00e0 t\u1ed1t \u0111\u1eb9p. H\u1eefu Minh l\u00e0 c\u00f3 \u0111\u1ee9c t\u00ednh t\u1ed1t, tr\u00ed \u00f3c th\u00f4ng minh, s\u00e1ng d\u1ea1", "sex": 3}
{"first_name": "Kh\u1ea3i Minh", "meaning": "Minh ngh\u0129a l\u00e0 th\u00f4ng minh t\u00e0i tr\u00ed hay c\u00f2n c\u00f3 ngh\u0129a l\u00e0 b\u1eaft \u0111\u1ea7u nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. Kh\u1ea3i c\u00f3 ngh\u0129a l\u00e0 vui t\u01b0\u01a1i h\u00e2n hoa. Kh\u1ea3i Minh ngh\u0129a l\u00e0 cha m\u1eb9 mong con l\u1edbn l\u00ean lu\u00f4n s\u1ed1ng vui t\u01b0\u01a1i, y\u00eau \u0111\u1eddi & b\u1ea3n t\u00ednh th\u00f4ng minh, s\u00e1ng d\u1ea1", "sex": 3}
{"first_name": "Khang Minh", "meaning": "\"Khang\" c\u00f3 ngh\u0129a l\u00e0 gi\u00e0u c\u00f3, vui v\u1ebb, \u0111\u1ee7 \u0111\u1ea7y. \"Minh\" l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh. Khang Minh mang \u00fd ngh\u0129a con s\u1ebd c\u00f3 cu\u1ed9c s\u1ed1ng sung s\u01b0\u1edbng, gi\u00e0u c\u00f3, lu\u00f4n vui t\u01b0\u01a1i, h\u1ea1nh ph\u00fac, b\u1ea3n t\u00ednh th\u00f4ng minh, lanh l\u1ee3i.", "sex": 3}
{"first_name": "Kh\u00e1nh Minh", "meaning": "\"Kh\u00e1nh\" l\u00e0 s\u1ef1 gi\u00e0u c\u00f3, vui v\u1ebb, h\u00e2n hoan. \"Minh\" l\u00e0 th\u00f4ng minh hay l\u00e0 \u00e1nh s\u00e1ng. \"Kh\u00e1nh Minh\" l\u00e0 \u00e1nh s\u00e1ng c\u1ee7a ni\u1ec1m vui, l\u00e0 t\u00ean \u0111\u1ec3 ch\u1ec9 t\u01b0\u01a1ng lai s\u00e1ng l\u1ea1ng, lu\u00f4n vui v\u1ebb, gi\u00e0u c\u00f3.", "sex": 3}
{"first_name": "Kh\u00f4i Minh", "meaning": "\"Kh\u00f4i\" l\u00e0 kh\u00f4i ng\u00f4, tu\u1ea5n t\u00fa. \"Minh\" theo ti\u1ebfng H\u00e1n l\u00e0 th\u00f4ng minh, s\u00e1ng s\u1ee7a Khi \u0111\u1eb7t cho con c\u00e1i t\u00ean n\u00e0y, b\u1ed1 m\u1eb9 mu\u1ed1n con l\u1edbn l\u00ean tr\u1edf th\u00e0nh ch\u00e0ng trai kh\u00f4i ng\u00f4 v\u00e0 th\u00f4ng minh, h\u1ecdc gi\u1ecfi. L\u00e0 m\u1ed9t t\u00ean hay d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho b\u00e9 trai.", "sex": 3}
{"first_name": "Khu\u00ea Minh", "meaning": "\"Khu\u00ea\": l\u00e0 t\u00ean m\u1ed9t v\u00ec sao tr\u00ean b\u1ea7u tr\u1eddi t\u01b0\u1ee3ng tr\u01b0ng cho \"Kim\" trong ng\u0169 H\u00e0nh. Do v\u1eady sao khu\u00ea c\u00f2n \u0111\u01b0\u1ee3c g\u1ecdi l\u00e0 sao Kim, sao H\u00f4m hay Sao Mai. \u0110\u00e2y l\u00e0 v\u00ec sao \u0111\u1eb9p nh\u1ea5t, v\u00e0 s\u00e1ng nh\u1ea5t tr\u00ean b\u1ea7u tr\u1eddi. Sao Khu\u00ea c\u00f2n \u0111\u01b0\u1ee3c coi l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a s\u1ef1 th\u00f4ng minh, tr\u00ed tu\u1ec7 v\u00e0 h\u1ecdc v\u1ea5n. \"Minh\" l\u00e0 th\u00f4ng minh, s\u00e1ng su\u1ed1t, lanh l\u1ee3i, tinh kh\u00f4n, c\u00f3 ngh\u0129a l\u00e0 \"s\u00e1ng nh\u01b0 v\u00ec sao Khu\u00ea\". Cha m\u1eb9 hay \u0111\u1eb7t t\u00ean cho con c\u00e1i l\u00e0 \"Khu\u00ea Minh\" v\u1edbi mong mu\u1ed1n con c\u00e1i m\u00ecnh s\u1ebd lu\u00f4n th\u00f4ng minh, gi\u1ecfi giang, th\u00e0nh \u0111\u1ea1t v\u00e0 to\u1ea3 s\u00e1ng nh\u01b0 v\u00ec sao Khu\u00ea tr\u00ean b\u1ea7u tr\u1eddi.", "sex": 7}
{"first_name": "Li\u00eam Minh", "meaning": "Minh ngh\u0129a l\u00e0 th\u00f4ng minh t\u00e0i tr\u00ed hay c\u00f2n c\u00f3 ngh\u0129a l\u00e0 b\u1eaft \u0111\u1ea7u nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. Li\u00eam ngh\u0129a l\u00e0 li\u00eam khi\u1ebft, trong s\u1ea1ch. Li\u00eam Minh ngh\u0129a l\u00e0 con th\u00f4ng minh, s\u00e1ng d\u1ea1 & s\u1ed1ng li\u00eam khi\u1ebft, trong s\u1ea1ch", "sex": 3}
{"first_name": "Long Minh", "meaning": "\"Long\" l\u00e0 r\u1ed3ng \"Minh\" l\u00e0 minh m\u1eabn, s\u00e1ng su\u1ed1t, th\u00f4ng minh. \"Long Minh\" mang \u00fd ngh\u0129a tr\u00ed th\u00f4ng minh c\u1ee7a lo\u00e0i r\u1ed3ng, tr\u00ed th\u00f4ng minh cao nh\u1ea5t c\u1ee7a \u0111\u1ea5t tr\u1eddi, v\u1ea1n v\u1eadt. V\u1edbi t\u00ean n\u00e0y cha m\u1eb9 mong con th\u00e0nh ng\u01b0\u1eddi t\u00e0i n\u0103ng, th\u00f4ng minh, s\u00e1ng su\u1ed1t, tr\u00ed tu\u1ec7 tinh anh, t\u01b0\u01a1ng lai s\u00e1ng l\u1ea1ng.", "sex": 3}
