{"first_name": "T\u00e2m Minh", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t ch\u1eef  \"Minh\" ngh\u0129a l\u00e0 tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft, s\u00e1ng su\u1ed1t, \"T\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 tr\u00e1i tim, l\u00e0 t\u00e2m h\u1ed3n. T\u00ean \" T\u00e2m Minh\"  d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi v\u1eeba th\u00f4ng minh, tr\u00ed tu\u1ec7 v\u1eeba c\u00f3 m\u1ed9t t\u1ea5m l\u00f2ng nh\u00e2n h\u1eadu, t\u1ea5m h\u1ed3n trong s\u00e1ng. \u0110\u00e2y h\u1eb3n l\u00e0 \u0111i\u1ec1u m\u00e0 ba m\u1eb9 n\u00e0o c\u0169ng mu\u1ed1n con m\u00ecnh c\u00f3 \u0111\u01b0\u1ee3c", "sex": 5}
{"first_name": "T\u00e2n Minh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Minh\" c\u00f3 ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, th\u00f4ng minh, hi\u1ec3u bi\u1ebft, \"T\u00e2n\" c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 m\u1edbi l\u1ea1, m\u1edbi m\u1ebb. T\u00ean \"Minh T\u00e2n\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, t\u00e0i tr\u00ed, c\u00f3 t\u01b0 duy s\u00e1ng su\u1ed1t, lu\u00f4n \u0111am m\u00ea, kh\u00e1m ph\u00e1 \u0111i\u1ec1u hay, \u0111i\u1ec1u m\u1edbi l\u1ea1. \" T\u00e2n Minh\" l\u00e0 c\u00e1i t\u00ean g\u1eedi g\u1eafm ni\u1ec1m hy v\u1ecdng c\u1ee7a ba m\u1eb9 mong con s\u1ebd l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, kh\u1edfi \u0111\u1ea7u nh\u1eefng \u0111i\u1ec1u m\u1edbi m\u1ebb v\u00e0 t\u1ed1t \u0111\u1eb9p", "sex": 3}
