{"first_name": "Th\u1ea1ch Minh", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t,\"Minh\" c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, nhanh nh\u1eb9n, tinh anh. \"Th\u1ea1ch\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u00e1, t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 c\u1ee9ng c\u1ecfi, trung th\u00e0nh. T\u00ean \"Th\u1ea1ch Minh \" th\u01b0\u1eddng \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi th\u00f4ng minh, t\u00e0i tr\u00ed, m\u1ea1nh m\u1ebd, ki\u00ean c\u01b0\u1eddng. \u0110\u1eb7t con t\u00ean \"Minh Th\u1ea1ch\" l\u00e0 mong con sau n\u00e0y c\u00f3 t\u01b0\u01a1ng lai t\u01b0\u01a1i s\u00e1ng, th\u00e0nh c\u00f4ng v\u00e0 l\u00e0 ch\u1ed7 d\u1ef1a v\u1eb5ng ch\u1eafc cho c\u1ea3 gia \u0111\u00ecnh", "sex": 3}
{"first_name": "Th\u00e1i Minh", "meaning": "\"Th\u00e1i\" l\u00e0 th\u00f4ng th\u00e1i, tr\u00ed tu\u1ec7. \"Minh\" l\u00e0 th\u00f4ng minh. \"Th\u00e1i Minh\" mang \u00fd ngh\u0129a con l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh, s\u00e1ng su\u1ed1t bi\u1ebft suy ngh\u0129, c\u00f3 tr\u00ed tu\u1ec7 th\u00f4ng th\u00e1i. V\u1edbi t\u00ean n\u00e0y cha m\u1eb9 mong con ham h\u1ecdc h\u1ecfi, gi\u1ecfi giang, ph\u00e1t tri\u1ec3n t\u01b0\u01a1ng lai tr\u00ean con \u0111\u01b0\u1eddng h\u1ecdc v\u1ea5n.", "sex": 3}
