{"first_name": "Thanh Minh", "meaning": "Minh ngh\u0129a l\u00e0 th\u00f4ng minh t\u00e0i tr\u00ed hay c\u00f2n c\u00f3 ngh\u0129a l\u00e0 b\u1eaft \u0111\u1ea7u nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. Thanh ngh\u0129a l\u00e0 thanh cao, trong s\u1ea1ch. Thanh Minh ngh\u0129a l\u00e0 con th\u00f4ng minh, tinh anh, s\u00e1ng d\u1ea1 & s\u1ed1ng thanh cao", "sex": 3}
