{"first_name": "\u0110\u1ed3ng B\u1eb1ng", "meaning": "Trong \u0111i\u0323a ly\u0301 ho\u0323c, \"\u0111\u00f4\u0300ng b\u0103\u0300ng\" hay bi\u0300nh nguy\u00ean la\u0300 m\u1ed9t v\u00f9ng \u0111\u1ea5t \u0111ai r\u1ed9ng l\u1edbn v\u1edbi \u0111\u1ecba h\u00ecnh th\u1ea5p t\u01b0\u01a1ng \u0111\u1ed1i b\u1eb1ng ph\u1eb3ng. Du\u0300ng vi\u0323 tri\u0301 \u0111i\u0323a ly\u0301 \u0111\u0103\u0323t t\u00ean cho con, ngoa\u0300i ti\u0301nh ch\u00e2\u0301t \u0111\u00f4\u0323c \u0111a\u0301o, b\u00f4\u0301 me\u0323 hi vo\u0323ng con cu\u00f4\u0323c s\u00f4\u0301ng cu\u0309a con nh\u01b0 vu\u0300ng \u0111\u00f4\u0300ng b\u0103\u0300ng tru\u0300 phu\u0301, quanh n\u0103m phu\u0300 sa b\u00f4\u0300i \u0111\u0103\u0301p y\u0301 chi\u0309 cu\u00f4\u0323c s\u00f4\u0301ng sung tu\u0301c, thi\u0323nh v\u01b0\u01a1\u0323ng da\u0300nh cho con.", "sex": 3}
{"first_name": "\u0110\u1ee9c B\u1eb1ng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\u0110\u1ee9c\" t\u1ee9c l\u00e0 ph\u1ea9m h\u1ea1nh, t\u00e1c phong t\u1ed1t \u0111\u1eb9p, quy ph\u1ea1m m\u00e0 con ng\u01b0\u1eddi ph\u1ea3i tu\u00e2n theo, ch\u1ec9 chung nh\u1eefng vi\u1ec7c t\u1ed1t l\u00e0nh l\u1ea5y \u0111\u1ea1o \u0111\u1ec3 l\u1eadp th\u00e2n. \"B\u1eb1ng\" c\u00f3 ngh\u0129a l\u00e0 c\u00f4ng b\u1eb1ng, b\u00ecnh \u0111\u1eb3ng, kh\u00f4ng thi\u00ean v\u1ecb, b\u00ean tr\u1ecdng b\u00ean khinh, s\u1ed1ng th\u1eb3ng ngay, l\u00e0m \u0111i\u1ec1u thi\u1ec7n, t\u00e2m trong s\u00e1ng.", "sex": 3}
{"first_name": "Giang B\u1eb1ng", "meaning": "\"Giang\" c\u00f3 ngh\u0129a l\u00e0 con s\u00f4ng - tr\u01b0\u1eddng giang, giang s\u01a1n. \"B\u0103\u0300ng\" trong t\u01b0\u0300 \u0111\u00f4\u0300ng b\u0103\u0300ng y\u0301 chi\u0309 vu\u0300ng \u0111\u00e2\u0301t ma\u0300u m\u01a1\u0303 phu\u0300 sa b\u00f4\u0300i \u0111\u0103\u0301p. K\u00ea\u0301t h\u01a1\u0323p \"Giang\" va\u0300 \"B\u0103\u0300ng\" du\u0300ng \u0111\u00ea\u0309 \u0111\u0103\u0323t t\u00ean cho con g\u01a1\u0323i l\u00ean b\u01b0\u0301c tranh \u0111\u00f4\u0300ng qu\u00ea phong ca\u0309nh h\u01b0\u0303u ti\u0300nh, y\u0301 chi\u0309 ng\u01b0\u01a1\u0300i hi\u00ea\u0300n la\u0300nh, ti\u0301nh ti\u0300nh \u00f4n ho\u0300a.", "sex": 3}
