{"first_name": "S\u01a1n B\u1eb1ng", "meaning": "S\u01a1n B\u1eb1ng\" l\u00e0 t\u00ean x\u00e3 thu\u1ed9c huy\u1ec7n H\u01b0\u01a1ng S\u01a1n, H\u00e0 T\u0129nh, m\u1ed9t t\u1ec9nh ven bi\u1ec3n thu\u1ed9c v\u00f9ng B\u1eafc Trung B\u1ed9 Vi\u1ec7t Nam. Khi sinh ra v\u00e0 l\u1edbn l\u00ean, nhi\u1ec1u ng\u01b0\u1eddi thay \u0111\u1ed5i n\u01a1i sinh s\u1ed1ng. V\u00ec v\u1eady, b\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean theo nguy\u00ean qu\u00e1n cho con v\u1edbi \u00fd ni\u1ec7m t\u01b0\u1edfng nh\u1edb v\u1ec1 qu\u00ea nh\u00e0, ho\u1eb7c c\u00f3 th\u1ec3 \u0111\u00e2y l\u00e0 \u0111\u1ecba \u0111i\u1ec3m g\u1eafn li\u1ec1n v\u1edbi t\u00ecnh y\u00eau b\u1ed1 m\u1eb9 ho\u1eb7c ghi d\u1ea5u k\u1ef7 ni\u1ec7m n\u01a1i con sinh ra \u0111\u1eddi.", "sex": 3}
