{"first_name": "Di\u1ec5m B\u0103ng", "meaning": "\"Di\u1ec5m\" \u00fd ch\u1ec9 t\u1ed1t \u0111\u1eb9p, v\u1ebb t\u01b0\u01a1i s\u00e1ng, xinh \u0111\u1eb9p l\u1ed9ng l\u1eaby th\u01b0\u1eddng ng\u1ee5 \u00fd ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p, y\u1ec3u \u0111i\u1ec7u. \"B\u0103ng\" theo ngh\u0129a H\u00e1n Vi\u1ec7t v\u1eeba h\u00e0m \u00fd ch\u1ec9 c\u00e1i l\u1ea1nh b\u0103ng gia\u0301 v\u1eeba di\u1ec5n t\u1ea3 h\u00ecnh \u1ea3nh b\u0103ng tuy\u1ebft tr\u1eafng mu\u1ed1t, ng\u1ecdc ng\u00e0. V\u00ec v\u1eady, t\u00ean \"Di\u00ea\u0303m B\u0103ng\" th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 mi\u00eau t\u1ea3 ng\u01b0\u1eddi con g\u00e1i, dung m\u1ea1o xinh \u0111\u1eb9p, l\u00e0n da tr\u1eafng n\u00f5n, ng\u01b0\u1eddi c\u00f3 ph\u1ea9m h\u1ea1nh, kh\u00ed ti\u1ebft thanh cao, t\u1ea5m l\u00f2ng trong s\u00e1ng kh\u00f3 lay \u0111\u1ed9ng", "sex": 5}
{"first_name": "Duy B\u0103ng", "meaning": "\"Duy B\u0103ng\" l\u00e0 t\u00ean ri\u00eang \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con trai \u1edf Vi\u1ec7t Nam. \"B\u0103ng\" v\u1eeba h\u00e0m \u00fd ch\u1ec9 c\u00e1i l\u1ea1nh b\u0103ng gia\u0301 v\u1eeba di\u1ec5n t\u1ea3 h\u00ecnh \u1ea3nh b\u0103ng tuy\u1ebft tr\u1eafng mu\u1ed1t, ng\u1ecdc ng\u00e0. \"Duy\" ngh\u0129a l\u00e0 suy ngh\u0129. \"Duy B\u0103ng\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c g\u1eedi g\u1eafm v\u1edbi \u00fd ngh\u0129a v\u1ec1 cu\u1ed9c s\u1ed1ng c\u1ee7a m\u1ed9t con ng\u01b0\u1eddi th\u00f4ng minh, t\u00e0i n\u0103ng h\u01a1n ng\u01b0\u1eddi. Con l\u00e0 \u0111\u1ee9a con th\u00f4ng minh, khi\u0301 ti\u00ea\u0301t thanh cao m\u00e0 t\u1ea1o h\u00f3a ban t\u1eb7ng ri\u00eang cho b\u00f4\u0301 me\u0323.", "sex": 3}
{"first_name": "H\u1ea1 B\u0103ng", "meaning": "H\u1ea1 B\u0103ng l\u00e0 t\u00ean d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i. H\u1ea1 B\u0103ng trong ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 tuy\u1ebft gi\u1eefa m\u00f9a h\u00e8. Cha m\u1eb9 \u0111\u1eb7t t\u00ean cho con g\u00e1i nh\u01b0 v\u1eady v\u1edbi mong \u01b0\u1edbc con s\u1ebd c\u00f3 m\u1ed9t v\u1ebb \u0111\u1eb9p thu\u1ea7n khi\u1ebft nh\u01b0 b\u0103ng, s\u1ef1 th\u00f4ng minh v\u00e0 t\u00e0i gi\u1ecfi m\u00e0 hi\u1ebfm ng\u01b0\u1eddi n\u00e0o c\u00f3 \u0111\u01b0\u1ee3c.", "sex": 5}
