{"first_name": "Ho\u00e0ng B\u0103ng", "meaning": "\"Ho\u00e0ng\" c\u00f3 ngh\u0129a l\u00e0 r\u1ea1ng ng\u1eddi, r\u1ef1c r\u1ee1, t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 ph\u1ed3n th\u1ecbnh, ph\u00e1t tri\u1ec3n v\u00e0 \u0111\u1eb9p nh\u1ea5t c\u1ee7a m\u1ed9t th\u1eddi \u0111\u1ea1i. \"B\u0103ng\" theo ngh\u0129a H\u00e1n Vi\u1ec7t  v\u1eeba h\u00e0m \u00fd ch\u1ec9 c\u00e1i l\u1ea1nh b\u0103ng gia\u0301 v\u1eeba di\u1ec5n t\u1ea3 h\u00ecnh \u1ea3nh b\u0103ng tuy\u1ebft tr\u1eafng mu\u1ed1t, ng\u1ecdc ng\u00e0. C\u00e1i t\u00ean Ho\u00e0ng B\u0103ng \u0111\u01b0\u1ee3c g\u1eedi g\u1eafm v\u1edbi \u00fd ngh\u0129a v\u1ec1 m\u1ed9t cu\u1ed9c s\u1ed1ng h\u1ea1nh ph\u00fac c\u1ee7a ng\u01b0\u1eddi c\u00f3 c\u00e1ch nh\u00ecn cu\u1ed9c s\u1ed1ng \u0111\u00e1ng tr\u00e2n tr\u1ecdng.", "sex": 7}
