{"first_name": "Kim B\u0103ng", "meaning": "\"Kim\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ti\u1ec1n, l\u00e0 v\u00e0ng. T\u00ean \"Kim\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c cha m\u1eb9 \u0111\u1eb7t v\u1edbi h\u00e0m \u00fd mong mu\u1ed1n cu\u1ed9c s\u1ed1ng sung t\u00fac, ph\u00fa qu\u00fd v\u1eefng b\u1ec1n, ki\u00ean c\u1ed1 d\u00e0nh cho con c\u00e1i. \"B\u0103ng\" theo ngh\u0129a H\u00e1n Vi\u1ec7t  v\u1eeba h\u00e0m \u00fd ch\u1ec9 c\u00e1i l\u1ea1nh b\u0103ng gia\u0301 v\u1eeba di\u1ec5n t\u1ea3 h\u00ecnh \u1ea3nh b\u0103ng tuy\u1ebft tr\u1eafng mu\u1ed1t, ng\u1ecdc ng\u00e0. T\u00ean \"Kim B\u0103ng\" th\u00ea\u0309 hi\u00ea\u0323n ba m\u1eb9 mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi v\u1eeba xinh \u0111\u1eb9p gi\u1ecfi giang th\u00e0nh c\u00f4ng trong cu\u1ed9c s\u1ed1ng \u0111em l\u1ea1i nhi\u1ec1u \u0111i\u1ec1u t\u01b0\u01a1i \u0111\u1eb9p v\u00e0 \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi qu\u00fd m\u1ebfn.", "sex": 5}
