{"first_name": "Ng\u1ecdc B\u0103ng", "meaning": "\"Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed. \"B\u0103ng\" theo ngh\u0129a H\u00e1n Vi\u1ec7t v\u1eeba h\u00e0m \u00fd ch\u1ec9 c\u00e1i l\u1ea1nh b\u0103ng gia\u0301 v\u1eeba di\u1ec5n t\u1ea3 h\u00ecnh \u1ea3nh b\u0103ng tuy\u1ebft tr\u1eafng mu\u1ed1t, ng\u1ecdc ng\u00e0. T\u00ean \"Ng\u1ecdc B\u0103ng\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi con ga\u0301i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, l\u00e0n da tr\u1eafng n\u00f5n, ng\u01b0\u1eddi c\u00f3 ph\u1ea9m h\u1ea1nh, kh\u00ed ti\u1ebft thanh cao, t\u1ea5m l\u00f2ng trong s\u00e1ng kh\u00f3 lay \u0111\u1ed9ng khi\u00ea\u0301n ng\u01b0\u01a1\u0300i kha\u0301c tr\u00e2\u0300m tr\u00f4\u0300, ng\u01b0\u01a1\u0303ng m\u00f4\u0323.", "sex": 5}
{"first_name": "S\u01a1n B\u0103ng", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t, \"S\u01a1n\" l\u00e0 n\u00fai, t\u00ednh ch\u1ea5t c\u1ee7a n\u00fai l\u00e0 lu\u00f4n v\u1eefng ch\u00e3i, h\u00f9ng d\u0169ng v\u00e0 tr\u1ea7m t\u0129nh. V\u00ec v\u1eady t\u00ean \"S\u01a1n\" g\u1ee3i c\u1ea3m gi\u00e1c oai nghi, b\u1ea3n l\u0129nh, c\u00f3 th\u1ec3 l\u00e0 ch\u1ed7 d\u1ef1a v\u1eefng ch\u1eafc an to\u00e0n. \"B\u0103ng\" theo ngh\u0129a H\u00e1n Vi\u1ec7t v\u1eeba h\u00e0m \u00fd ch\u1ec9 c\u00e1i l\u1ea1nh b\u0103ng gia\u0301 v\u1eeba di\u1ec5n t\u1ea3 h\u00ecnh \u1ea3nh b\u0103ng tuy\u1ebft tr\u1eafng mu\u1ed1t, ng\u1ecdc ng\u00e0. V\u00ec v\u1eady, t\u00ean \"S\u01a1n B\u0103ng\" th\u01b0\u1eddng d\u00f9ng \u0111\u00ea\u0309 chi\u0309 ngu\u01a1\u0300i oai nghi\u00eam, da\u0301ng ve\u0309 hu\u0300ng vy\u0303, khi\u0301 pha\u0301ch ki\u00ean \u0111i\u0323nh kho\u0301 lay.", "sex": 3}
{"first_name": "T\u00e2m B\u0103ng", "meaning": "\"T\u00e2m B\u0103ng\" c\u00f3 ngh\u0129a l\u00e0 t\u00e2m h\u1ed3n trong s\u00e1ng nh\u01b0 b\u0103ng tuy\u1ebft, \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i v\u1edbi mong \u01b0\u1edbc t\u00e2m h\u1ed3n con s\u1ebd lu\u00f4n trong s\u00e1ng, th\u00e1nh thi\u1ec7n.", "sex": 5}
{"first_name": "Thanh B\u0103ng", "meaning": "\"Thanh\" t\u01b0\u0301c m\u00e0u xanh, s\u1ef1 trong s\u00e1ng, thanh khi\u1ebft. \"B\u0103ng\" theo ngh\u0129a H\u00e1n Vi\u1ec7t  v\u1eeba h\u00e0m \u00fd ch\u1ec9 c\u00e1i l\u1ea1nh b\u0103ng gia\u0301 v\u1eeba di\u1ec5n t\u1ea3 h\u00ecnh \u1ea3nh b\u0103ng tuy\u1ebft tr\u1eafng mu\u1ed1t, ng\u1ecdc ng\u00e0. V\u00ec v\u1eady, t\u00ean \"Thanh B\u0103ng\" th\u01b0\u1eddng  d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean v\u1edbi \u00fd ngh\u0129a mong cho t\u00e2m h\u1ed3n con s\u1ebd lu\u00f4n trong s\u00e1ng, \u0111\u1eb9p nh\u01b0 kh\u00f4\u0301i b\u0103ng thanh khi\u00ea\u0301t v\u00e0 \u00edt g\u1eb7p ph\u1ea3i gi\u00f4ng t\u1ed1 trong cu\u1ed9c \u0111\u1eddi.", "sex": 5}
{"first_name": "Th\u1ebf B\u0103ng", "meaning": "Ch\u1eef \"Th\u1ebf\" mang ngh\u0129a quy\u1ec1n th\u1ebf, quy\u1ec1n l\u1ef1c. T\u00ean con mang tham v\u1ecdng v\u1ec1 quy\u1ec1n l\u1ef1c s\u1ee9c m\u1ea1nh to l\u1edbn c\u00f3 th\u1ec3 t\u1ea1o ra nh\u1eefng \u0111i\u1ec1u v\u0129 \u0111\u1ea1i. \"B\u0103ng\" theo ngh\u0129a H\u00e1n Vi\u1ec7t  v\u1eeba h\u00e0m \u00fd ch\u1ec9 c\u00e1i l\u1ea1nh b\u0103ng gia\u0301 v\u1eeba di\u1ec5n t\u1ea3 h\u00ecnh \u1ea3nh b\u0103ng tuy\u1ebft tr\u1eafng mu\u1ed1t, ng\u1ecdc ng\u00e0. \"Th\u00ea\u0301 B\u0103ng\" th\u01b0\u01a1\u0300ng du\u0300ng \u0111\u00ea\u0309 mi\u00eau ta\u0309 ng\u01b0\u01a1\u0300i co\u0301 khi\u0301 ti\u00ea\u0301t thanh cao, th\u00ea\u0309 pha\u0301ch c\u01b0\u01a1\u0300ng tra\u0301ng, ma\u0323nh me\u0303.", "sex": 3}
