{"first_name": "\u0110\u1ea1i B\u1ea3o", "meaning": "\"\u0110\u1ea1i\" trong ti\u1ebfng H\u00e1n vi\u1ec7t di\u1ec5n t\u1ea3 s\u1ef1 to l\u1edbn, b\u00e1ch \u0111\u1ea1i, \u0111\u1ea1i gia, c\u00f3 th\u1ec3 l\u00e0m ch\u1ed7 d\u1ef1a v\u1eefng ch\u1eafc cho m\u1ecdi ng\u01b0\u1eddi, \"\u0110\u1ea1i\" c\u00f2n th\u1ec3 hi\u1ec7n tinh th\u1ea7n qu\u1ea3ng \u0111\u1ea1i, s\u1ef1 r\u1ed9ng r\u00e3i, quang minh ch\u00ednh \u0111\u1ea1i. Ch\u1eef \"B\u1ea3o\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. \u0110\u0103\u0323t t\u00ean na\u0300y cho con th\u1ec3 hi\u1ec7n s\u1ef1 uy nghi\u00eam, quy\u1ec1n qu\u00fd, cao sang, lu\u00f4n m\u1ea1nh m\u1ebd, v\u1eefng ch\u1eafc.", "sex": 3}
{"first_name": "\u0110\u0103ng B\u1ea3o", "meaning": "\"\u0110\u0103ng B\u1ea3o\" l\u00e0 t\u00ean \u0111\u1eb9p th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho c\u00e1c b\u00e9 trai. \"\u0110\u0103ng\" c\u00f3 ngh\u0129a l\u00e0 ng\u1ecdn \u0111\u00e8n k\u1ebft h\u1ee3p c\u00f9ng \"B\u1ea3o\" th\u01b0\u1eddng  g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. B\u1ed1 m\u1eb9 ch\u1ecdn t\u00ean n\u00e0y cho con mong mu\u1ed1n l\u1edbn l\u00ean con s\u1ebd t\u1ecfa s\u00e1ng, gi\u1ecfi giang, th\u00e0nh \u0111\u1ea1t. Con nh\u01b0 ng\u1ecdn \u0111\u00e8n qu\u00fd, l\u00e0 b\u1ea3o v\u1eadt m\u00e0 b\u1ed1 m\u1eb9 lu\u00f4n n\u00e2ng niu, gi\u1eef g\u00ecn.", "sex": 3}
{"first_name": "\u0110i\u1ec1n B\u1ea3o", "meaning": "\"\u0110i\u1ec1n\" ngoa\u0300i y\u0301 chi\u0309 ru\u1ed9ng l\u00faa, n\u00f3 c\u00f2n c\u00f3 ngh\u0129a li\u00ean t\u01b0\u1edfng l\u00e0 ch\u1ec9 t\u00ednh c\u00e1ch ngay th\u1eb3ng th\u1eadt th\u00e0, ch\u00e2n ch\u1ea5t, ph\u00fac h\u1eadu ...c\u1ee7a con ng\u01b0\u1eddi. Ch\u1eef \"B\u1ea3o\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. V\u00ec v\u1eady, t\u00ean \"\u0110i\u00ea\u0300n B\u1ea3o\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con nh\u01b0 h\u00e0m \u00fd con ch\u00ednh l\u00e0 b\u1ea3o v\u1eadt m\u00e0 b\u1ed1 m\u1eb9 lu\u00f4n n\u00e2ng niu, gi\u1eef g\u00ecn. B\u00ean c\u1ea1nh, t\u00ean \"\u0110i\u00ea\u0300n B\u1ea3o\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean hay \u0111\u1eb7t cho c\u00e1c b\u00e9 trai v\u1edbi \u00fd ngh\u0129a mong con lu\u00f4n l\u00e0m vi\u1ec7c thi\u1ec7n v\u00e0 c\u00f3 \u0111\u01b0\u1ee3c nhi\u1ec1u ph\u00fac l\u1ed9c, may m\u1eafn.", "sex": 3}
{"first_name": "Di\u1ec7p B\u1ea3o", "meaning": "Theo ti\u1ebfng H\u00e1n- Vi\u1ec7t l\u00e0 ch\u1eef \"Di\u1ec7p\" ch\u00ednh l\u00e0 \"l\u00e1\" trong Kim Chi Ng\u1ecdc Di\u1ec7p. Ch\u1eef \"B\u1ea3o\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. V\u00ec v\u1eady, \u0111\u1eb7t t\u00ean n\u00e0y cho con ng\u1ee5  \u00fd mu\u1ed1n n\u00f3i con nh\u00e0 quy\u1ec1n qu\u00fd sang gi\u00e0u, d\u00f2ng d\u00f5i danh gi\u00e1. B\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n th\u1ec3 hi\u1ec7n mong mu\u1ed1n t\u1ed1t \u0111\u1eb9p c\u1ee7a b\u1ed1 m\u1eb9 \u0111\u1ec3 con m\u00ecnh lu\u00f4n ki\u00eau sa, qu\u00fd ph\u00e1i khi \u0111\u01b0\u1ee3c \u0111\u1eb7t t\u00ean n\u00e0y.", "sex": 5}
