{"first_name": "Duy B\u1ea3o", "meaning": "Ch\u1eef \"B\u1ea3o\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. \"Duy\" nghi\u0303a duy nh\u00e2\u0301t, duy chi\u0309. \u0110\u0103\u0323t t\u00ean na\u0300y, b\u00f4\u0301 me\u0323 ngu\u0323 y\u0301 con l\u00e0 \u0111\u1ee9a b\u00e9 th\u00f4ng minh, qu\u00fd b\u00e1u cu\u0309a gia \u0111i\u0300nh.", "sex": 3}
