{"first_name": "Hoa B\u1ea3o", "meaning": "\"Hoa\" l\u00e0 s\u1ef1  k\u1ebft tinh \u0111\u1eb9p \u0111\u1ebd c\u1ee7a tr\u1eddi \u0111\u1ea5t, hoa mang \u0111\u1ebfn s\u1ef1 sinh \u0111\u1ed9ng & t\u00f4 \u0111i\u1ec3m s\u1eafc m\u00e0u cho cu\u1ed9c s\u1ed1ng. Ch\u1eef \"B\u1ea3o\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. T\u00ean \"Hoa Ba\u0309o\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho n\u1eef, ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi con g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, thu h\u00fat, khi\u0301 ti\u00ea\u0301t thanh cao \u0111\u01b0\u01a1\u0323c mo\u0323i ng\u01b0\u01a1\u0300i y\u00eau quy\u0301.", "sex": 5}
