{"first_name": "Nguy\u00ean B\u1ea3o", "meaning": "Nguy\u00ean\" c\u00f3 ngh\u0129a l\u00e0 tinh kh\u00f4i, \u0111\u1eb9p \u0111\u1ebd, g\u1ee3i l\u00ean \u00fd ngh\u0129a d\u1eabn \u0111\u1ea7u, s\u00e1ng s\u1ee7a, v\u1eefng v\u00e0ng, \u0111i\u1ec1m \u0111\u1ea1m. B\u00ean c\u1ea1nh, t\u00ean \"B\u1ea3o\" c\u00f2n \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 cu\u1ed9c s\u1ed1ng \u1ea5m \u00eam lu\u00f4n \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng. \u0110\u1eb7t t\u00ean cho con l\u00e0 \"Nguy\u00ean B\u1ea3o\", b\u1ed1 m\u1eb9 ng\u1ea7m g\u1eedi g\u1eafm th\u00f4ng \u0111i\u1ec7p r\u1eb1ng con ch\u00ednh l\u00e0 b\u1ea3o v\u1eadt m\u00e0 b\u1ed1 m\u1eb9 lu\u00f4n tr\u00e2n qu\u00fd h\u00e0ng \u0111\u1ea7u.", "sex": 3}
{"first_name": "Nh\u1ea5t B\u1ea3o", "meaning": "\"Nh\u1ea5t\" c\u00f3 ngh\u0129a l\u00e0 huy ho\u00e0ng nh\u1ea5t, r\u1ef1c r\u1ee1 nh\u1ea5t, l\u00e0 s\u1ed1 1. \"Nh\u1ea5t B\u1ea3o\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean \u0111\u1eb9p cho c\u00e1c b\u00e9 trai v\u1edbi mong mu\u1ed1n t\u01b0\u01a1ng lai con s\u1ebd \u0111\u1ea1t \u0111\u01b0\u1ee3c nhi\u1ec1u th\u00e0nh t\u1ef1u to l\u1edbn, r\u1ef1c r\u1ee1 nh\u1ea5t v\u00e0 lu\u00f4n l\u00e0 ng\u01b0\u1eddi \u0111\u1ee9ng \u1edf v\u1ecb tr\u00ed s\u1ed1 m\u1ed9t.", "sex": 3}
{"first_name": "Nh\u1eadt B\u1ea3o", "meaning": "\"Nh\u1eadt\" trong ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 m\u1eb7t tr\u1eddi \"B\u1ea3o\" t\u1ee9c nh\u1eefng g\u00ec qu\u00fd gi\u00e1 lu\u00f4n \u0111\u01b0\u1ee3c g\u00ecn gi\u1eef, b\u1ea3o v\u1ec7. T\u00ean \"Nh\u1eadt B\u1ea3o\" th\u01b0\u1eddng d\u00f9ng cho c\u00e1c b\u00e9 trai h\u00e0m \u00fd  con s\u1ebd lu\u00f4n t\u1ecfa s\u00e1ng nh\u01b0 m\u1eb7t tr\u1eddi, r\u1ef1c r\u1ee1 v\u00e0 qu\u00fd gi\u00e1. B\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n \u00fd ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u1ecfa s\u00e1ng nh\u01b0 \u00e1nh m\u1eb7t tr\u1eddi lan t\u1ecfa, m\u1ed9t n\u00e9t \u0111\u1eb9p d\u00f9 c\u00f3 ng\u1eafm bao l\u1ea7n c\u0169ng h\u00e1o h\u1ee9c nh\u01b0 l\u1ea7n \u0111\u1ea7u m\u1edbi th\u1ea5y.", "sex": 3}
{"first_name": "Nh\u01b0 B\u1ea3o", "meaning": "\"Nh\u01b0\" mang ngh\u0129a t\u01b0\u01a1ng t\u1ef1, gi\u1ed1ng nh\u01b0, c\u00f3 \u00fd so s\u00e1nh. Ch\u1eef \"B\u1ea3o\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. \"Nh\u01b0 Ba\u0309o\" co\u0301 th\u00ea\u0309 du\u0300ng \u0111\u00ea\u0309 \u0111\u0103\u0323t t\u00ean cho ca\u0309 be\u0301 trai l\u00e2\u0303n ga\u0301i nh\u0103\u0300m vi\u0301 von con nh\u01b0 ho\u0300n qu\u00f4\u0301c ba\u0309o ch\u00e2u ba\u0301u ma\u0300 b\u00f4\u0301 me\u0323 lu\u00f4n n\u00e2ng niu, gi\u01b0\u0303 gi\u0300n.", "sex": 5}
{"first_name": "Phi B\u1ea3o", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng, ch\u1eef \"B\u1ea3o\" th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o, \"Phi\" c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u01b0 bay - di chuy\u1ec3n v\u1edbi t\u1ed1c \u0111\u1ed9 cao, \u00fd n\u00f3i \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi nhanh nh\u1eb9n, lanh l\u1ee3i.  T\u00ean \"Phi B\u1ea3o\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con v\u1edbi h\u00e0m \u00fd con ch\u00ednh l\u00e0 b\u1ea3o v\u1eadt m\u00e0 b\u1ed1 m\u1eb9 lu\u00f4n n\u00e2ng niu, gi\u1eef g\u00ecn, mong con s\u1ebd th\u00f4ng minh, c\u00f3 tr\u00ed tu\u1ec7 v\u00e0 nhanh nh\u1eb9n.", "sex": 3}
{"first_name": "Ph\u00fa B\u1ea3o", "meaning": "\"Ph\u00fa\" ngh\u0129a l\u00e0 \u0111\u01b0\u1ee3c cho, \u0111\u01b0\u1ee3c ban ph\u00e1t. Ch\u1eef \"B\u1ea3o\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. \"Phu\u0301 Ba\u0309o\" la\u0300 t\u00ean th\u01b0\u01a1\u0300ng du\u0300ng \u0111\u0103\u0323t cho be\u0301 trai \u01a1\u0301i y\u0301 nghi\u0303a con chi\u0301nh la\u0300 ch\u00e2u ba\u0301u quy\u0301 gia\u0301 \u0111\u01b0\u1ee3c tr\u1eddi ban cho b\u00f4\u0301 me\u0323.", "sex": 3}
{"first_name": "Ph\u00fac B\u1ea3o", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng, ch\u1eef \"B\u1ea3o\" th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o, \"Ph\u00fac\" c\u00f3 ngh\u0129a l\u00e0 nh\u1eefng \u0111i\u1ec1u t\u1ed1t l\u00e0nh. T\u00ean \"Ph\u00fac B\u1ea3o\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi \u01b0\u1edbc mong c\u1ee7a ba m\u1eb9 mong con s\u1ebd c\u00f3 \u0111\u01b0\u1ee3c m\u1ed9t cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean, h\u1ea1nh ph\u00fac, m\u1ecdi \u0111i\u1ec1u t\u1ed1t l\u00e0nh s\u1ebd \u0111\u1ebfn v\u1edbi con b\u1edfi v\u00ec con ch\u00ednh l\u00e0 b\u00e1u v\u1eadt c\u1ee7a ba m\u1eb9.", "sex": 3}
{"first_name": "Ph\u01b0\u01a1ng B\u1ea3o", "meaning": "\"B\u1ea3o\" c\u00f3 ngh\u0129a l\u00e0 qu\u00fd gi\u00e1, qu\u00fd ph\u1ea3i; \"Ph\u01b0\u01a1ng\" l\u00e0 m\u00f9i h\u01b0\u01a1ng. T\u00ean \"Ph\u01b0\u01a1ng B\u1ea3o\" c\u00f3 \u00fd ngh\u0129a l\u00e0 m\u00f9i h\u01b0\u01a1ng qu\u00fd ph\u00e1i, v\u1edbi mong \u01b0\u1edbc con s\u1ebd l\u00e0 m\u1ed9t c\u00f4 g\u00e1i \u0111\u00e0i c\u00e1c \u0111\u00e1ng y\u00eau.", "sex": 5}
{"first_name": "Qu\u00e2n B\u1ea3o", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, ch\u1eef \"B\u1ea3o\" th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o, \"Qu\u00e2n\" c\u00f3 ngh\u0129a l\u00e0 Vua. T\u00ean \"Qu\u00e2n B\u1ea3o\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi \u00fd ngh\u0129a con l\u00e0 b\u00e1u v\u1eadt qu\u00fd gi\u00e1 \u0111\u1ed1i v\u1edbi cha m\u1eb9, mong con s\u1ebd th\u00f4ng minh, t\u00e0i tr\u00ed, l\u00e0m n\u00ean s\u1ef1 nghi\u1ec7p.", "sex": 3}
{"first_name": "Qu\u1ed1c B\u1ea3o", "meaning": "T\u00ean \"Qu\u1ed1c B\u1ea3o\" h\u00e0m ch\u1ee9a t\u00ecnh c\u1ea3m y\u00eau th\u01b0\u01a1ng tha thi\u1ebft & tr\u00e2n tr\u1ecdng d\u00e0nh cho con c\u00e1i. \"Qu\u1ed1c B\u1ea3o\" c\u00f3 ngh\u0129a l\u00e0 con thi\u00eang li\u00eang & qu\u00fd gi\u00e1 nh\u01b0 ch\u00e2u b\u00e1u, v\u1eadt ph\u1ea9m cao qu\u00fd c\u1ee7a qu\u1ed1c gia", "sex": 3}
