{"first_name": "Thanh B\u1ea3o", "meaning": "\"Thanh\"d\u1ecbch s\u00e1t ngh\u0129a l\u00e0 m\u00e0u xanh, tuy nhi\u00ean thanh c\u00f2n l\u00e0 s\u1ef1 thanh cao, trong s\u1ea1ch, thanh b\u1ea1ch, lu\u00f4n c\u00f3 kh\u00ed ch\u1ea5t \u0111i\u1ec1m \u0111\u1ea1m, nh\u1eb9 nh\u00e0ng v\u00e0 cao qu\u00fd. K\u1ebft h\u1ee3p v\u1edbi \"B\u1ea3o\" \u00fd ch\u1ec9 s\u1ef1 qu\u00fd gi\u00e1, lu\u00f4n \u0111\u01b0\u1ee3c b\u1ea3o v\u1ec7, g\u00ecn gi\u1eef. \"Thanh B\u1ea3o\" l\u00e0 t\u00ean b\u1ed1 m\u1eb9 ch\u1ecdn cho con v\u1edbi \u00fd ngh\u0129a con l\u00e0 m\u1ed9t v\u1eadt qu\u00fd gi\u00e1 c\u1ee7a c\u1ee7a gia \u0111\u00ecnh, \u0111\u1ea5y l\u00e0 m\u1ed9t s\u1ef1 tuy\u1ec7t di\u1ec7u.", "sex": 3}
{"first_name": "Thi\u00ean B\u1ea3o", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"B\u1ea3o\" c\u00f3 ngh\u0129a l\u00e0 v\u1eadt tr\u00e2n qu\u00fd, qu\u00fd gi\u00e1, \"Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eddi. \"B\u1ea3o Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 b\u00e1u v\u1eadt, b\u1ea3o b\u1ed1i c\u1ee7a tr\u1eddi. T\u00ean \"Thi\u00ean B\u1ea3o\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi t\u1ea5t c\u1ea3 ni\u1ec1m y\u00eau th\u01b0\u01a1ng c\u1ee7a cha m\u1eb9 d\u00e0nh cho con, mong con lu\u00f4n \u0111\u01b0\u1ee3c y\u00eau th\u01b0\u01a1ng, n\u00e2ng niu nh\u01b0 b\u00e1u v\u1eadt, ngo\u00e0i ra \"Thi\u00ean B\u1ea3o\" c\u00f2n c\u00f3 ng\u1ee5 \u00fd ch\u1ec9 ng\u01b0\u1eddi \u0111a t\u00e0i, th\u00f4ng minh.", "sex": 3}
{"first_name": "Thi\u1ec7n B\u1ea3o", "meaning": "\"Thi\u1ec7n\" th\u01b0\u01a1\u0300ng du\u0300ng \u0111\u00ea\u0309 chi\u0309 l\u00e0 ng\u01b0\u1eddi t\u1ed1t, c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, th\u1ec3 hi\u1ec7n t\u00ecnh th\u01b0\u01a1ng bao la b\u00e1c \u00e1i, th\u01b0\u01a1ng ng\u01b0\u1eddi. Ch\u1eef \"B\u1ea3o\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. V\u00ec v\u1eady, t\u00ean \"Thi\u00ea\u0323n B\u1ea3o\"th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con nh\u01b0 h\u00e0m \u00fd con ch\u00ednh l\u00e0 b\u1ea3o v\u1eadt m\u00e0 b\u1ed1 m\u1eb9 lu\u00f4n n\u00e2ng niu, gi\u1eef g\u00ecn. B\u00ean c\u1ea1nh, c\u00f2n \u0111\u1ec3 ch\u1ec9 mong mu\u00f4\u0301n con c\u00f3 cu\u1ed9c s\u1ed1ng \u1ea5m \u00eam lu\u00f4n \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng.", "sex": 3}
{"first_name": "Thi\u1ec7u B\u1ea3o", "meaning": "Ch\u01b0\u0303 \"Thi\u00ea\u0323u\" c\u01a1 ba\u0309n ba\u0300n v\u00ea\u0300 \u0111\u01b0\u0301c ti\u0301nh t\u00f4\u0301t \u0111e\u0323p, cao th\u01b0\u01a1\u0323ng cu\u0309a con ng\u01b0\u01a1\u0300i. \"Ch\u1eef B\u1ea3o\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. V\u00ec v\u1eady, t\u00ean \"Thi\u1ec7\u0323u B\u1ea3o\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con nh\u01b0 h\u00e0m \u00fd con ch\u00ednh l\u00e0 b\u1ea3o v\u1eadt xinh \u0111e\u0323p my\u0303 mi\u00ea\u0300u ma\u0300 b\u00f4\u0301 me\u0323 lu\u00f4n ch\u0103m so\u0301c gi\u01b0\u0303 gi\u0300n.", "sex": 3}
{"first_name": "Th\u1ecbnh B\u1ea3o", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Th\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ea7y, nhi\u1ec1u, h\u01b0ng v\u01b0\u1ee3ng, ph\u1ed3n vinh, phong ph\u00fa. Ch\u1eef \"B\u1ea3o\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. \u0110\u1eb7t con t\u00ean \"Th\u1ecbnh Ba\u0309o\" l\u00e0 mong mu\u1ed1n con c\u00f3 \u0111\u1ee7 t\u00e0i n\u0103ng, cu\u1ed9c s\u1ed1ng sung t\u00fac, gi\u00e0u sang, \u1ea5m no, h\u1ea1nh ph\u00fac.", "sex": 3}
