{"first_name": "Ti\u1ec3u B\u1ea3o", "meaning": "\"Ti\u00ea\u0309u\" theo nghi\u0303a Ha\u0301n Vi\u00ea\u0323t y\u0301 chi\u0309 s\u01b0\u0323 nho\u0309 nh\u0103\u0301n, xinh x\u0103\u0301n. Ch\u1eef \"B\u1ea3o\" th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. V\u00ec v\u1eady, du\u0300ng t\u00ean \"Ti\u00ea\u0309u B\u1ea3o\" \u0111\u1eb7t cho con nh\u01b0 h\u00e0m \u00fd con ch\u00ednh l\u00e0 ti\u00ea\u0309u ba\u0309o b\u00f4\u0301i -  b\u1ea3o v\u1eadt nho\u0309 be\u0301 m\u00e0 b\u1ed1 m\u1eb9 lu\u00f4n n\u00e2ng niu, gi\u1eef g\u00ecn.", "sex": 3}
