{"first_name": "Tu\u1ea5n B\u1ea3o", "meaning": "\"Tu\u1ea5n\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t l\u00e0 ch\u00e0ng trai c\u00f3 di\u1ec7n m\u1ea1o tu\u1ea5n t\u00fa, \u0111a t\u00e0i, t\u1ea1o \u0111\u01b0\u1ee3c \u1ea5n t\u01b0\u1ee3ng v\u00e0 thi\u1ec7n c\u1ea3m v\u1edbi nh\u1eefng ng\u01b0\u1eddi xung quanh. \"B\u1ea3o\" g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. \"Tu\u1ea5n B\u1ea3o\" l\u00e0 t\u00ean b\u1ed1 m\u1eb9 ch\u1ecdn cho con trai h\u00e0m \u00fd con c\u00f3 cu\u1ed9c s\u1ed1ng t\u1ed1t \u0111\u1eb9p, lu\u00f4n \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng.", "sex": 3}
