{"first_name": "Thu\u1eadn Minh", "meaning": "\"Thu\u1eadn\" l\u00e0 ho\u00e0 thu\u1eadn, hi\u1ebfu thu\u1eadn, ... \u00fd mu\u1ed1n n\u00f3i t\u1edbi nh\u1eefng \u0111i\u1ec1u di\u1ec5n ra su\u00f4n s\u1ebb, thu\u1eadn l\u1ee3i, theo \u00fd mu\u1ed1n c\u1ee7a m\u00ecnh. \"Minh\" l\u00e0 s\u00e1ng, th\u00f4ng minh, s\u00e1ng su\u1ed1t, minh m\u1eabn \"Thu\u1eadn Minh\" g\u1ee3i l\u00ean \u00fd ngh\u0129a mong con s\u1ebd tr\u1edf th\u00e0nh ng\u01b0\u1eddi th\u00f4ng minh, gi\u1ecfi giang v\u00e0 lu\u00f4n g\u1eb7p \u0111\u01b0\u1ee3c nhi\u1ec1u may m\u1eafn, thu\u1eadn l\u1ee3i trong cu\u1ed9c s\u1ed1ng.", "sex": 3}
