{"first_name": "Th\u00fay Minh", "meaning": "Minh ngh\u0129a l\u00e0 th\u00f4ng minh t\u00e0i tr\u00ed hay c\u00f2n c\u00f3 ngh\u0129a l\u00e0 b\u1eaft \u0111\u1ea7u nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. Th\u00fay l\u00e0 ng\u1ecdc th\u00fay may m\u1eafn, xinh \u0111\u1eb9p. Th\u00fay Minh ngh\u0129a l\u00e0 con xinh \u0111\u1eb9p, qu\u00fd gi\u00e1 & cs\u00e1ng d\u1ea1 th\u00f4ng minh", "sex": 7}
{"first_name": "Th\u00f9y Minh", "meaning": "Minh ngh\u0129a l\u00e0 th\u00f4ng minh t\u00e0i tr\u00ed hay c\u00f2n c\u00f3 ngh\u0129a l\u00e0 b\u1eaft \u0111\u1ea7u nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. Th\u00f9y l\u00e0 th\u00f9y m\u1ecb, di\u1ec7u d\u00e0ng. Th\u00f9y Minh ngh\u0129a l\u00e0 con v\u1eeba th\u00f4ng minh, s\u00e1ng d\u1ea1 v\u1eeba th\u00f9y m\u1ecb, d\u1ecbu d\u00e0ng. \u0110\u00e2y l\u00e0 t\u00ean d\u00e0nh cho ng\u01b0\u1eddi con g\u00e1i", "sex": 7}
