{"first_name": "T\u00edn Minh", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, Minh c\u00f2n c\u00f3 ngh\u0129a ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (b\u00ecnh minh) th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. T\u00ean \" T\u00edn Minh\" th\u1ec3 hi\u1ec7n m\u1ed9t n\u1ec1m tin tuy\u1ec7t \u0111\u1ed1i c\u1ee7a cha m\u1eb9 r\u1eb1ng con m\u00ecnh s\u1ebd l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh, hi\u1ec3u bi\u1ebft, \u0111\u00e1ng tin c\u1eady", "sex": 3}
{"first_name": "To\u00e0n Minh", "meaning": "Theo ngh\u0129a H\u00e1n -Vi\u1ec7t, \"Minh\" c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, hi\u1ec3u bi\u1ebft, s\u00e1ng su\u1ed1t, \"To\u00e0n\" c\u00f3 ngh\u0129a l\u00e0 tr\u1ecdn v\u1eb9n, \u0111\u1ea7y \u0111\u1ee7, kh\u00f4ng thi\u1ebfu s\u00f3t. T\u00ean \" To\u00e0n Minh\" th\u1ec3 hi\u1ec7n mong mu\u1ed1n cho con c\u00f3 \u0111\u01b0\u1ee3c m\u1ed9t tr\u00ed tu\u1ec7, tr\u00ed th\u00f4ng minh ho\u00e0n h\u1ea3o, kh\u00f4ng khi\u1ebfm khuy\u1ebft", "sex": 3}
