{"first_name": "Trang Minh", "meaning": "\"Trang\" : \u0111oan trang, v\u1ebb \u0111\u1eb9p d\u1ecbu d\u00e0ng n\u1eef t\u00ednh \"Minh\": trong s\u00e1ng, th\u00f4ng minh, s\u00e1ng su\u1ed1t.\"Trang Minh\" l\u00e0 t\u00e2m \u00fd c\u1ee7a ba m\u1eb9,mong con sau n\u00e0y th\u00e0nh ng\u01b0\u1eddi con g\u00e1i v\u1eeba th\u00f4ng minh v\u1eeba \u0111oan trang, c\u00f3 v\u1ebb \u0111\u1eb9p k\u00edn \u0111\u00e1o, nh\u1eb9 nh\u00e0ng \u0111\u1ea7y n\u1eef t\u00ednh.", "sex": 5}
{"first_name": "Tri Minh", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, \"Minh\" mang ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh, t\u00e0i tr\u00ed. \"Tri\" ngo\u00e0i ngh\u0129a l\u00e0 tr\u00ed, t\u1ee9c l\u00e0 c\u00f3 hi\u1ec3u bi\u1ebft, tr\u00ed tu\u1ec7, c\u00f2n d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn  ng\u01b0\u1eddi b\u1ea1n th\u00e2n r\u1ea5t hi\u1ec3u l\u00f2ng m\u00ecnh. T\u00ean \" Tri Minh\" mang \u00fd ngh\u0129a mong con l\u00e0 ng\u01b0\u1eddi c\u00f3 tr\u00ed th\u1ee9c, th\u00f4ng minh, gi\u1ecfi giang, th\u00e2n thi\u1ec7n, \u00f4n h\u00f2a", "sex": 5}
