{"first_name": "Tri\u1ebft Minh", "meaning": "\"Minh\": th\u00f4ng minh, s\u00e1ng su\u1ed1t, minh m\u1eabn, \"Tri\u1ebft\" l\u00e0 s\u1ef1 hi\u1ec3u bi\u1ebft s\u00e2u s\u1eafc. \"Tri\u1ebft Minh\" c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh v\u00e0 hi\u1ec3u bi\u1ebft s\u00e2u r\u1ed9ng. \u0110\u1eb7t t\u00ean con l\u00e0 \"Tri\u1ebft Minh\" c\u00f3 ngh\u0129a l\u00e0 mong con s\u1ebd lu\u00f4n th\u00f4ng minh, s\u00e1ng su\u1ed1t, bi\u1ebft nh\u00ecn xa tr\u00f4ng r\u1ed9ng v\u00e0 hi\u1ec3u bi\u1ebft th\u1eddi th\u1ebf \u0111\u1ec3 c\u00f3 th\u1ec3 n\u1eafm b\u1eaft \u0111\u01b0\u1ee3c nh\u1eefng c\u01a1 h\u1ed9i th\u00e0nh c\u00f4ng trong cu\u1ed9c s\u1ed1ng.", "sex": 3}
