{"first_name": "Trung Minh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Minh\" c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, hi\u1ec3u bi\u1ebft, s\u00e1ng su\u1ed1t, \"Trung c\u00f3 ngh\u0129a l\u00f2ng trung th\u00e0nh, l\u00e0 s\u1ef1 t\u1eadn trung, kh\u00f4ng thay l\u00f2ng \u0111\u1ed5i d\u1ea1. T\u00ean \" Trung Minh\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, c\u00f3 ph\u1ea9m ch\u1ea5t trung th\u00e0nh, c\u00f3 t\u00e0i c\u00f3 \u0111\u1ee9c, l\u00e0m \u0111\u01b0\u1ee3c nh\u1eefng vi\u1ec7c l\u1edbn v\u00e0 th\u00e0nh \u0111\u1ea1t", "sex": 3}
