{"first_name": "T\u00f9ng Minh", "meaning": "Theo ngh\u0129a h\u00e1n vi\u1ec7t \" Minh \" l\u00e0 trong s\u00e1ng, hi\u1ec3u bi\u1ebft, c\u00f3 tr\u00ed tu\u1ec7. C\u00e2y t\u00f9ng hi\u00ean ngang, m\u1ea1nh m\u1ebd, lu\u00f4n s\u00e1ng ng\u1eddi ph\u1ea9m ch\u1ea5t cao qu\u00fd. T\u00ean \" T\u00f9ng Minh \" n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi con trai m\u1ea1nh m\u1ebd, hi\u00ean ngang, t\u00e0i gi\u1ecfi v\u00e0 hi\u1ec3u bi\u1ebft.", "sex": 3}
