{"first_name": "V\u0169 Minh", "meaning": "Minh ngh\u0129a l\u00e0 th\u00f4ng minh t\u00e0i tr\u00ed hay c\u00f2n c\u00f3 ngh\u0129a l\u00e0 b\u1eaft \u0111\u1ea7u nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. V\u0169 l\u00e0 uy l\u1ef1c, m\u1ea1nh m\u1ebd. V\u0169 Minh ngh\u0129a l\u00e0 con th\u00f4ng minh, s\u00e1ng d\u1ea1 & m\u1ea1nh m\u1ebd \u0111\u1ea7y uy l\u1ef1c. T\u00ean n\u00e0y d\u00e0nh cho ng\u01b0\u1eddi con trai", "sex": 3}
