{"first_name": "Tu\u1ec7 B\u1ea3o", "meaning": "\u0110\u00e2y l\u00e0 t\u00ean hay c\u00f3 th\u1ec3 d\u00f9ng cho c\u1ea3 con trai v\u00e0 con g\u00e1i v\u1edbi \"Tu\u1ec7\" ngh\u0129a l\u00e0 tr\u00ed th\u00f4ng minh, tr\u00ed tu\u1ec7. \"B\u1ea3o\" ch\u00ednh l\u00e0 b\u1ea3o v\u1eadt m\u00e0 b\u1ed1 m\u1eb9 lu\u00f4n n\u00e2ng niu, gi\u1eef g\u00ecn. B\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean con th\u1ebf n\u00e0y v\u1edbi mong mu\u1ed1n \u0111\u1ee9a tr\u1ebb sinh ra s\u1ebd l\u00e0 m\u1ed9t ng\u01b0\u1eddi r\u1ea5t th\u00f4ng minh t\u00e0i gi\u1ecfi, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng.", "sex": 7}
