{"first_name": "B\u1ea3o Phong", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, ch\u1eef \"B\u1ea3o\" ngh\u0129a l\u00e0 v\u1eadt tr\u00e2n qu\u00fd, r\u1ea5t c\u00f3 gi\u00e1 tr\u1ecb, \"Phong\" ngh\u0129a l\u00e0 gi\u00f3. T\u00ean \"B\u1ea3o Phong\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 di\u1ec7n m\u1ea1o nh\u00ecn r\u1ea5t thanh cao, sang tr\u1ecdng, kh\u1ecfe m\u1ea1nh v\u00e0 r\u1ea5t t\u00e0i gi\u1ecfi. T\u00ean \"B\u1ea3o Phong\" l\u00e0 l\u1eddi y\u00eau th\u01b0\u01a1ng m\u00e0 cha m\u1eb9 g\u1eedi g\u1eafm \u0111\u1ebfn con y\u00eau, con l\u00e0 v\u00f4 gi\u00e1 \u0111\u1ed1i v\u1edbi cha m\u1eb9, cha m\u1eb9 y\u00eau th\u01b0\u01a1ng con v\u00e0 tr\u00e2n qu\u00fd con nh\u01b0 m\u1ed9t b\u00e1u v\u1eadt. Mong con s\u1ebd tr\u1edf th\u00e0nh ng\u01b0\u1eddi t\u00e0i gi\u1ecfi v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng gi\u00e0u sang, quy\u1ec1n qu\u00fd", "sex": 3}
