{"first_name": "Duy Phong", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, ch\u1eef \"Duy\" ngh\u0129a l\u00e0 gi\u1eef g\u00ecn, b\u1ea3o v\u1ec7, \"Phong\" ngh\u0129a l\u00e0 gi\u00f3. \"Duy Phong\" \u00fd n\u00f3i \u0111\u1ebfn ng\u1ecdn gi\u00f3 \u0111\u01b0\u1ee3c b\u1ea3o v\u1ec7, gi\u1eef g\u00ecn. T\u00ean \"\u0110\u1ee9c Phong\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 \u0111\u1ebfn ng\u01b0\u1eddi c\u00f3 quy\u1ec1n l\u1ef1c, c\u00f3 t\u00e0i n\u0103ng \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi b\u1ea3o v\u1ec7, gi\u00fap \u0111\u1ee1, y\u00eau th\u01b0\u01a1ng. T\u00ean \"\u0110\u1ee9c Phong\" l\u00e0 mong mu\u1ed1n c\u1ee7a cha m\u1eb9 v\u1edbi \u0111\u1ee9a con th\u00e2n y\u00eau c\u1ee7a m\u00ecnh, con m\u00ecnh s\u1ebd r\u1ea5t t\u00e0i gi\u1ecfi, m\u1ea1nh kh\u1ecfe nh\u01b0 c\u01a1n gi\u00f3, l\u1ea1i \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, b\u1ea3o v\u1ec7", "sex": 3}
