{"first_name": "Kh\u1ea3i Phong", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, ch\u1eef \"Kh\u1ea3i\" ngh\u0129a l\u00e0 \u1ea5m \u00e1p, \u00f4n h\u00f2a, ch\u1eef \"Phong\" ngh\u0129a l\u00e0 gi\u00f3. \"Kh\u1ea3i Phong\" ngh\u0129a l\u00e0 gi\u00f3 nam \u00f4n h\u00f2a \u1ea5m \u00e1p - l\u00e0 c\u01a1n gi\u00f3 th\u1ed5i t\u1eeb hai h\u01b0\u1edbng, m\u1ed9t l\u00e0 h\u01b0\u1edbng t\u00e2y nam th\u01b0\u1eddng \u1ea5m \u00e1p v\u00e0 c\u00f3 h\u01a1i n\u00f3ng \u1ea9m, hai l\u00e0 th\u1ed5i t\u1eeb h\u01b0\u1edbng \u0111\u00f4ng nam sang th\u01b0\u1eddng m\u00e1t m\u1ebb v\u00e0 d\u1ec5 ch\u1ecbu. T\u00ean \"Kh\u1ea3i Phong\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 t\u00ednh c\u00e1ch \u00f4n h\u00f2a, d\u1ec5 m\u1ebfn, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi qu\u00fd m\u1ebfn v\u00e0 k\u00ednh tr\u1ecdng. T\u00ean \"Kh\u1ea3i Phong\" l\u00e0 mong mu\u1ed1n c\u1ee7a cha m\u1eb9 r\u1eb1ng con m\u00ecnh lu\u00f4n \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, v\u00e0 mong con s\u1ebd mang l\u1ea1i huy ho\u00e0ng v\u00e0 vinh d\u1ef1 cho d\u00f2ng t\u1ed9c", "sex": 3}
