{"first_name": "Linh Phong", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, ch\u1eef \"Linh\" ngh\u0129a l\u00e0 trong s\u00e1ng, s\u00e1ng s\u1ee7a, \u00eam \u1ea3, nh\u1eb9 nh\u00e0ng, \"Phong\" ngh\u0129a l\u00e0 gi\u00f3. \"Linh Phong\" ngh\u0129a l\u00e0 gi\u00f3 nh\u1eb9, gi\u00f3 hiu hiu - nh\u1eefng c\u01a1n gi\u00f3 \u0111\u1ec1u \u0111\u1ec1u \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi y\u00eau th\u00edch v\u00ec n\u00f3 \u0111em l\u1ea1i c\u1ea3m gi\u00e1c tho\u1ea3i m\u00e1i, d\u1ec5 ch\u1ecbu. T\u00ean \"Linh Phong\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng con ng\u01b0\u1eddi c\u00f3 di\u1ec7n m\u1ea1o kh\u00f4i ng\u00f4, nhanh nh\u1eb9n nh\u01b0 nh\u1eefng c\u01a1n gi\u00f3, c\u00f3 t\u00e0i giao ti\u1ebfp, l\u00e0m ng\u01b0\u1eddi \u0111\u1ed1i di\u1ec7n c\u1ea3m th\u1ea5y tho\u1ea3i m\u00e1i, vui v\u1ebb. Nh\u1eefng ng\u01b0\u1eddi n\u00e0y th\u01b0\u1eddng \u0111\u01b0\u1ee3c y\u00eau m\u1ebfn v\u00e0 lu\u00f4n nh\u1eadn \u0111\u01b0\u1ee3c ni\u1ec1m tin t\u1eeb m\u1ecdi ng\u01b0\u1eddi. T\u00ean \"Linh Phong\" l\u00e0 mong mu\u1ed1n c\u1ee7a cha m\u1eb9 r\u1eb1ng \u0111\u1ee9a con th\u00e2n y\u00eau c\u1ee7a m\u00ecnh s\u1ebd \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi y\u00eau m\u1ebfn nh\u1edd bi\u1ebft c\u00e1ch \u0111\u1ed1i nh\u00e2n x\u1eed th\u1ebf", "sex": 3}
{"first_name": "Minh Phong", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, ch\u1eef \"Minh\" ngh\u0129a l\u00e0 hi\u1ec3u bi\u1ebft, s\u00e1ng su\u1ed1t, c\u00f3 tr\u00ed tu\u1ec7, ch\u1eef \"Phong\" c\u00f3 ngh\u0129a l\u00e0 gi\u00f3 b\u1ea5c - gi\u00f3 th\u1ed5i t\u1eeb h\u01b0\u1edbng b\u1eafc, th\u01b0\u1eddng c\u00f3 h\u01a1i l\u1ea1nh. T\u00ean \"Minh Phong\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 di\u1ec7n m\u1ea1o tu\u1ea5n t\u00fa, t\u00ednh t\u00ecnh ngay th\u1eb3ng, h\u00e0nh \u0111\u1ed9ng minh b\u1ea1ch, r\u00f5 r\u00e0ng, c\u00f3 tr\u00ed tu\u1ec7, th\u00f4ng minh. B\u00ean c\u1ea1nh \u0111\u00f3 h\u1ecd c\u00f2n m\u1ea1nh m\u1ebd nh\u01b0 gi\u00f3, ki\u00ean c\u01b0\u1eddng v\u00e0 d\u00e1m ngh\u0129 d\u00e1m l\u00e0m, d\u1ec5 \u0111\u1ea1t \u0111\u01b0\u1ee3c th\u00e0nh c\u00f4ng trong cu\u1ed9c s\u1ed1ng", "sex": 3}
{"first_name": "Nam Phong", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Phong \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con t\u00e0i gi\u1ecfi, ki\u00ean c\u01b0\u1eddng, c\u00f3 kh\u1ea3 n\u0103ng ch\u1ec9 huy, l\u00e3nh \u0111\u1ea1o \u0111\u1ec3 h\u01b0\u1edbng cu\u1ed9c s\u1ed1ng \u0111\u1ebfn nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p nh\u1ea5t", "sex": 3}
