{"first_name": "Ch\u00ednh Li\u00ean", "meaning": "\"Li\u00ean\" ph\u00e0m \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 t\u00e2m t\u00ednh thanh t\u1ecbnh, s\u1ed1ng ngay th\u1eb3ng, kh\u00f4ng v\u1ea9n \u0111\u1ee5c b\u1edfi nh\u1eefng phi\u1ec1n n\u00e3o c\u1ee7a s\u1ef1 \u0111\u1eddi, ph\u1ea9m ch\u1ea5t thanh cao, bi\u1ebft ki\u00ean nh\u1eabn, ch\u1ecbu th\u01b0\u01a1ng ch\u1ecbu kh\u00f3, m\u1ea1nh m\u1ebd sinh t\u1ed3n \u0111\u1ec3 v\u01b0\u01a1n vai gi\u1eefa \u0111\u1ea5t tr\u1eddi v\u1edbi t\u1ea5m l\u00f2ng b\u00e1c \u00e1i, bao dung.Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Ch\u00ednh\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u00fang \u0111\u1eafn, th\u1eb3ng th\u1eafn, h\u1ee3p v\u1edbi quy ph\u1ea1m, \u0111\u00fang theo ph\u00e9p t\u1eafc. V\u00ec v\u1eady \"Ch\u00ednh Li\u00ean\" l\u00e0 ng\u01b0\u1eddi thu\u1ea7n nh\u1ea5t, khu\u00f4n ph\u00e9p ch\u00ednh \u0111\u00e1ng, l\u00e0 ng\u01b0\u1eddi quang minh ch\u00ednh \u0111\u1ea1i, r\u00f5 r\u00e0ng, kh\u00f4ng thi\u00ean t\u01b0, l\u00f2ng d\u1ea1 ngay th\u1eb3ng.", "sex": 5}
{"first_name": "Chung Li\u00ean", "meaning": "\"Chung Li\u00ean\" th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi c\u00f3 t\u00ednh c\u00e1ch tr\u1ea7m t\u0129nh, ho\u00e0n h\u1ea3o, th\u1eadn tr\u1ecdng, nghi\u00eam t\u00fac, m\u1ea1nh m\u1ebd sinh t\u1ed3n \u0111\u1ec3 v\u01b0\u01a1n vai gi\u1eefa \u0111\u1ea5t tr\u1eddi v\u1edbi t\u1ea5m l\u00f2ng b\u00e1c \u00e1i, bao dung", "sex": 5}
{"first_name": "C\u01a1 Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen, lo\u00e0i hoa t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 thanh khi\u1ebft, trong s\u1ea1ch, d\u00f9 m\u1ecdc l\u00ean t\u1eeb b\u00f9n nh\u01a1 nh\u01b0ng kh\u00f4ng h\u1ec1 h\u00f4i tanh, v\u1eabn khoe s\u1eafc, ng\u00e1t h\u01b0\u01a1ng, \u0111\u1eb9p d\u1ecbu d\u00e0ng. \"C\u01a1\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 n\u1ec1n nh\u00e0, c\u0103n nguy\u00ean, ng\u1ee5 \u00fd v\u1ecb tr\u00ed g\u1ed1c r\u1ec5 quan tr\u1ecdng, vai tr\u00f2 quy\u1ebft \u0111\u1ecbnh. \"C\u01a1 Li\u00ean\" ph\u00e0m \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 t\u00e2m t\u00ednh thanh t\u1ecbnh, s\u1ed1ng ngay th\u1eb3ng, kh\u00f4ng v\u1ea9n \u0111\u1ee5c, c\u00f3 t\u00ednh quy\u1ebft \u0111o\u00e1n trong m\u1ecdi vi\u1ec7c", "sex": 5}
{"first_name": "C\u1ef1 Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen, lo\u00e0i hoa t\u01b0\u1ee3ng tr\u01b0ng cho v\u1ebb \u0111\u1eb9p thanh tao. \"C\u1ef1\" l\u00e0 s\u1ef1 to l\u1edbn. \"C\u1ef1 Li\u00ean\" h\u00e0m ngh\u0129a ng\u01b0\u1eddi lu\u00f4n c\u00f3 s\u1ef1 thanh khi\u1ebft, trong s\u1ea1ch d\u00f9 m\u1ecdc l\u00ean t\u1eeb b\u00f9n nh\u01a1 v\u00e0 l\u00e0 ng\u01b0\u1eddi c\u00f3 vai tr\u00f2 quan tr\u1ecdng, \u1ea3nh h\u01b0\u1edfng l\u1edbn.", "sex": 5}
{"first_name": "C\u00fac Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen, lo\u00e0i hoa t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 thanh khi\u1ebft, trong s\u1ea1ch, d\u00f9 m\u1ecdc l\u00ean t\u1eeb b\u00f9n nh\u01a1 nh\u01b0ng kh\u00f4ng h\u1ec1 h\u00f4i tanh, v\u1eabn khoe s\u1eafc, ng\u00e1t h\u01b0\u01a1ng, \u0111\u1eb9p d\u1ecbu d\u00e0ng. \"C\u00fac\" l\u00e0 m\u1ed9t lo\u00e0i th\u01b0\u1eddng n\u1edf r\u1ed9 v\u00e0o m\u00f9a thu, lo\u00e0i hoa nh\u00ecn c\u00f3 v\u1ebb b\u00ecnh th\u01b0\u1eddng, tuy h\u01a1i m\u1ecfng manh nh\u01b0ng s\u00e2u s\u1eafc v\u00e0 tinh t\u1ebf. V\u00ec v\u1eady, \"C\u00fac Li\u00ean\" l\u00e0 con ng\u01b0\u1eddi c\u00f3 v\u1ebb \u0111\u1eb9p trong s\u00e1ng, \u0111\u00e1ng y\u00eau, lu\u00f4n d\u1ecbu d\u00e0ng pha l\u1eabn uy\u1ec3n chuy\u1ec3n, l\u00e0 ng\u01b0\u1eddi tinh t\u1ebf trong m\u1ecdi vi\u1ec7c.", "sex": 5}
{"first_name": "Cung Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen, lo\u00e0i hoa t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 thanh khi\u1ebft, trong s\u1ea1ch. \"Cung\" theo phi\u00ean \u00e2m H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 k\u00ednh tr\u1ecdng, t\u00f4n k\u00ednh, th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 t\u1ecf \u00fd x\u01b0ng t\u1ee5ng, t\u00f4n tr\u1ecdng. \"Cung Li\u00ean\" th\u1ec3 hi\u1ec7n m\u1ed9t con ng\u01b0\u1eddi c\u00f3 l\u1ed1i s\u1ed1ng thanh tao, cao qu\u00fd, \u0111\u01b0\u1ee3c ng\u01b0\u1eddi kh\u00e1c t\u00f4n tr\u1ecdng, k\u00ednh c\u1ea9n, giao thi\u1ec7p v\u1edbi ng\u01b0\u1eddi kh\u00e1c trung th\u1ef1c, r\u00f5 r\u00e0ng.", "sex": 5}
