{"first_name": "\u0110an Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen, lo\u00e0i hoa t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 thanh khi\u1ebft, trong s\u1ea1ch. \"\u0110an\" theo H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 l\u1ebb, chi\u1ebfc, \u00fd ch\u1ec9 s\u1ef1 \u0111\u01a1n gi\u1ea3n, kh\u00f4ng ph\u1ee9c t\u1ea1p c\u1ea7u k\u1ef3. \"\u0110an Li\u00ean\" mang \u00fd ngh\u0129a ch\u1ec9 con ng\u01b0\u1eddi c\u00f3 v\u1ebb \u0111\u1eb9p trong s\u00e1ng v\u00e0 t\u00ednh c\u00e1ch gi\u1ea3n d\u1ecb, kh\u00f4ng c\u1ea7u k\u1ef3, ph\u1ee9c t\u1ea1p, hay ganh \u0111ua.", "sex": 5}
