{"first_name": "Giang Linh", "meaning": "\"Giang\" c\u00f3 ngh\u0129a l\u00e0 s\u00f4ng , \" Linh\" l\u00e0 th\u1ec3 hi\u1ec7n s\u1ef1 \u1ee9ng nghi\u1ec7m m\u00e0u nhi\u1ec7m, mang l\u1ea1i ni\u1ec1m vui, h\u1ea1nh ph\u00fac. \"Giang Linh\" mang \u00fd ngh\u0129a con l\u00e0 d\u00f2ng s\u00f4ng linh thi\u00eang mang l\u1ea1i nh\u1eefng \u0111i\u1ec1u t\u1ed1t l\u00e0nh cho m\u1ecdi ng\u01b0\u1eddi. Ngo\u00e0i ra t\u00ean n\u00e0y c\u00f2n c\u00f3 th\u1ec3 hi\u1ec3u l\u00e0 con th\u00f4ng minh, lanh l\u1eb9, xinh \u0111\u1eb9p v\u00ec Linh trong ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f2n c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, nhanh nh\u1eb9n.", "sex": 5}
