{"first_name": "H\u00e0 Linh", "meaning": "H\u00e0 l\u00e0 s\u00f4ng & Linh l\u00e0 \u1ee9ng nghi\u1ec7m. T\u00ean H\u00e0 Linh \u0111\u1ec3 ch\u1ec9 d\u00f2ng s\u00f4ng \u0111\u1eb9p, \u1ee9ng nghi\u1ec7m nh\u1eefng \u0111i\u1ec1u mong \u01b0\u1edbc t\u1ed1t l\u00e0nh c\u1ee7a con ng\u01b0\u1eddi. T\u00ean n\u00e0y \u0111\u1eb7t cho b\u00e9 v\u1edbi \u00fd ngh\u0129a mong con lu\u00f4n xinh \u0111\u1eb9p, g\u1eb7p may m\u1eafn nh\u01b0 nh\u1eefng l\u1eddi c\u1ea7u ch\u00fac c\u1ee7a cha m\u1eb9 tr\u00ean d\u00f2ng s\u00f4ng.", "sex": 5}
{"first_name": "H\u1ea3i Linh", "meaning": "H\u1ea3i Linh l\u00e0 t\u00ean ri\u00eang \u0111\u01b0\u1ee3c \u0111\u1eb7t cho c\u1ea3 trai v\u00e0 g\u00e1i, nh\u01b0ng ph\u1ed5 bi\u1ebfn d\u00e0nh cho con trai h\u01a1n. Theo ti\u1ebfng H\u00e1n, H\u1ea3i ngh\u0129a l\u00e0 bi\u1ec3n c\u1ea3 bao la. H\u1ea3i Linh l\u00e0 c\u00e1i t\u00ean mang r\u1ea5t nhi\u1ec1u th\u00f4ng \u0111i\u1ec7p v\u1ec1 cu\u1ed9c s\u1ed1ng t\u01b0\u01a1ng lai r\u1ed9ng m\u01a1\u0309.", "sex": 7}
{"first_name": "Ho\u00e0i Linh", "meaning": "Linh c\u00f3 ngh\u0129a l\u00e0 linh thi\u00eang hay c\u00f2n c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, lanh l\u1ee3i. Ho\u00e0i l\u00e0 m\u00e3i kh\u00f4ng th\u00f4i, l\u01b0u luy\u1ebfn. Ho\u00e0i Linh c\u00f3 ngh\u0129a con m\u00e3i xinh \u0111\u1eb9p, th\u00f4ng minh, lanh l\u1ee3i, lunh linh", "sex": 7}
{"first_name": "Ho\u00e0ng Linh", "meaning": "Ho\u00e0ng trong ti\u1ebfng H\u00e1n Vi\u1ec7t ngh\u0129a l\u00e0 t\u01b0\u01a1i s\u00e1ng, huy ho\u00e0ng, th\u1ec3 hi\u1ec7n s\u1ef1 gi\u00e0u sang sung t\u00fac. Linh c\u00f3 ngh\u0129a l\u00e0 \u0111i\u1ec1u t\u1ed1t th\u00e0nh s\u1ef1 th\u1eadt, \u1ee9ng nghi\u1ec7m, may m\u1eafn. T\u00ean Ho\u00e0ng Linh mang \u00fd ngh\u0129a cha m\u1eb9 mong con c\u00f3 cu\u1ed9c s\u1ed1ng sung s\u01b0\u1edbng, gi\u00e0u c\u00f3 sau n\u00e0y.", "sex": 7}
{"first_name": "H\u1ed3ng Linh", "meaning": "H\u1ed3ng Linh l\u00e0 t\u00ean ri\u00eang \u0111\u01b0\u1ee3c \u0111\u1eb7t cho c\u1ea3 con trai v\u00e0 con g\u00e1i \u1edf Vi\u1ec7t Nam. Theo ti\u1ebfng H\u00e1n, H\u1ed3ng ngh\u0129a l\u00e0 t\u01b0\u01a1i s\u00e1ng, Linh ngh\u0129a l\u00e0 th\u00f4ng minh lanh l\u1ee3i. H\u1ed3ng Linh l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c g\u1eedi g\u1eafm v\u1edbi \u00fd ngh\u0129a v\u1ec1 m\u1ed9t cu\u1ed9c s\u1ed1ng t\u01b0\u01a1i s\u00e1ng c\u1ee7a m\u1ed9t con ng\u01b0\u1eddi th\u00f4ng minh, lanh l\u1ee3i.", "sex": 7}
{"first_name": "Hu\u1ec7 Linh", "meaning": "\"Hoa hu\u1ec7 l\u00e0 lo\u00e0i hoa \u0111\u1eb9p, th\u01b0\u1eddng c\u00f3 m\u00e0u tr\u1eafng, m\u00f9i th\u01a1m lan t\u1ecfa. \u0110\u1ed1i v\u1edbi ng\u01b0\u1eddi Vi\u1ec7t Nam, hoa hu\u1ec7 cao qu\u00fd, th\u01b0\u1eddng \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 c\u00fang l\u1ec5.\r\nT\u00ean Hu\u1ec7 Linh \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i v\u1edbi \u00fd ngh\u0129a cha m\u1eb9 mong con xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng v\u00e0 \u0111oan trang nh\u01b0 \u0111\u00f3a hoa hu\u1ec7.\"", "sex": 5}
{"first_name": "H\u01b0\u01a1ng Linh", "meaning": "\u0110\u00e2y l\u00e0 t\u00ean ph\u1ed5 bi\u1ebfn th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i \u1edf Vi\u1ec7t Nam. \"Linh\" l\u00e0 linh thi\u00eang. \"H\u01b0\u01a1ng\": h\u01b0\u01a1ng th\u01a1m, m\u00e0u h\u1ed3ng. T\u00ean \"Linh H\u01b0\u01a1ng\" v\u1edbi \u00fd ngh\u0129a con l\u00e0 v\u1eadt b\u00e1u linh thi\u00eang v\u00e0 t\u1ecfa h\u01b0\u01a1ng cho \u0111\u1eddi. \u00dd ngh\u0129a s\u00e2u xa l\u00e0 cha m\u1eb9 mong con s\u1ed1ng c\u00f3 \u00edch, l\u00e0 ng\u01b0\u1eddi t\u1ed1t \u0111\u01b0\u1ee3c y\u00eau th\u01b0\u01a1ng.", "sex": 5}
{"first_name": "Kh\u00e1nh Linh", "meaning": "Linh c\u00f3 ngh\u0129a l\u00e0 linh thi\u00eang hay c\u00f2n c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, lanh l\u1ee3i. \"Kh\u00e1nh\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng s\u1ef1 vi\u1ec7c vui m\u1eebng, mang c\u1ea3m gi\u00e1c h\u00e2n hoan. Kh\u00e1nh Linh c\u00f3 ngh\u0129a con l\u00e0 c\u00f4 g\u00e1i xinh \u0111\u1eb9p, th\u00f4ng minh, lanh l\u1ee3i, mang \u0111\u1ebfn may m\u1eafn, vui t\u01b0\u01a1i cho gia \u0111\u00ecnh", "sex": 7}
{"first_name": "Khi\u1ebft Linh", "meaning": "Linh c\u00f3 ngh\u0129a l\u00e0 linh thi\u00eang hay c\u00f2n c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, lanh l\u1ee3i. Khi\u1ebft l\u00e0 n\u00f3i v\u1ec1 \u0111\u1ee9c t\u00ednh trong s\u00e1ng, thu\u1ea7n khi\u1ebft. Khi\u1ebft Linh c\u00f3 ngh\u0129a con xinh \u0111\u1eb9p, th\u00f4ng minh, lanh l\u1ee3i, t\u00ednh c\u00e1ch thu\u1ea7n khi\u1ebft, trong s\u00e1ng", "sex": 7}
{"first_name": "Ki\u1ec1u Linh", "meaning": "Linh c\u00f3 ngh\u0129a l\u00e0 linh thi\u00eang hay c\u00f2n c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, lanh l\u1ee3i. Ki\u1ec1u l\u00e0 xinh \u0111\u1eb9p, t\u00e0i s\u1eafc. Ki\u1ec1u Linh l\u00e0 t\u00ean d\u00e0nh cho ng\u01b0\u1eddi con g\u00e1i v\u1edbi \u00fd ngh\u0129a mong con xinh \u0111\u1eb9p, t\u00e0i s\u1eafc h\u01a1n ng\u01b0\u1eddi, khu\u00ea c\u00e1c \u0111oan trang, th\u00f4ng minh, gi\u1ecfi giang", "sex": 5}
{"first_name": "Mai Linh", "meaning": "\"Mai Linh\" c\u00f3 ngh\u0129a l\u00e0 c\u00e2y mai xinh \u0111\u1eb9p v\u00e0 linh thi\u00eang. Mang \u00fd ngh\u0129a l\u00e0 con s\u1ebd l\u00e0 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, mang ni\u1ec1m vui, h\u1ea1nh ph\u00fac, s\u1ef1 may m\u1eafn linh thi\u00ean ph\u00fac l\u00e0nh cho c\u1ea3 gia \u0111\u00ecnh, m\u1ecdi ng\u01b0\u1eddi lu\u00f4n y\u00eau m\u1ebfn con. V\u1edbi t\u00ean n\u00e0y cha m\u1eb9 c\u00f2n mong con l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh, lanh l\u1ee3i, lu\u00f4n vui t\u01b0\u01a1i, ho\u1ea1t b\u00e1t, y\u00eau \u0111\u1eddi v\u00ec mai l\u00e0 t\u00ean lo\u00e0i hoa n\u1edf v\u00e0o m\u00f9a xu\u00e2n b\u00e1o hi\u1ec7u tin vui, s\u1ef1 may m\u1eafn, kh\u1edfi \u0111\u1ea7u m\u1edbi, linh l\u00e0 th\u00f4ng minh, nhanh nh\u1eb9n.", "sex": 5}
{"first_name": "M\u1ef9 Linh", "meaning": "\"Linh\" l\u00e0 th\u00f4ng minh, lanh l\u1ee3i. \"M\u1ef9\" l\u00e0 \u0111\u1eb9p. \"M\u1ef9 Linh\" mang \u00fd ngh\u0129a con xinh \u0111\u1eb9p, th\u00f4ng minh, lanh l\u1ee3i.", "sex": 5}
{"first_name": "Nga Linh", "meaning": "\"Linh\" l\u00e0 th\u00f4ng minh lanh l\u1eb9, \"Nga\" l\u00e0 chim thi\u00ean Nga xinh \u0111\u1eb9p. T\u00ean \"Nga Linh\" mang \u00fd ngh\u0129a con l\u00e0 lo\u00e0i chim xinh \u0111\u1eb9p, th\u00f4ng minh s\u00e1ng d\u1ea1, d\u00e1ng v\u1ebb th\u01b0\u1edbt tha, uy\u1ec3n chuy\u1ec3n, c\u00e1c b\u01b0\u1edbc \u0111i t\u1ef1a nh\u01b0 \u0111ang m\u00faa", "sex": 5}
{"first_name": "Ng\u1ecdc Linh", "meaning": "\"\u0110\u00e2y l\u00e0 t\u00ean ph\u1ed5 bi\u1ebfn th\u01b0\u1eddng \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i \u1edf Vi\u1ec7t Nam.\r\nNg\u1ecdc: \u0111\u00e1 qu\u00fd c\u00f3 gi\u00e1 tr\u1ecb.\r\nLinh: lung linh, m\u1ec7nh s\u1ed1 \u0111\u1eb9p.\r\nNg\u1ecdc Linh v\u1edbi mong mu\u1ed1n con s\u1ebd c\u00f3 cu\u1ed9c s\u1ed1ng h\u1ea1nh ph\u00fac, ngo\u1ea1i h\u00ecnh xinh x\u1eafn, lanh l\u1ee3i & t\u00ednh t\u00ecnh thanh cao nh\u01b0 ng\u1ecdc.\"", "sex": 5}
{"first_name": "Nh\u1eadt Linh", "meaning": "\"Nh\u1eadt Linh c\u00f3 th\u1ec3 hi\u1ec3u l\u00e0 \"\"m\u1eb7t tr\u1eddi to\u1ea3 s\u00e1ng lung linh\"\". \r\n\"\"Nh\u1eadt\"\": m\u1eb7t tr\u1eddi, ban ng\u00e0y, ng\u00e0y. \r\n\"\"Linh\"\": l\u00e0 v\u1ebb \u0111\u1eb9p lung linh, s\u1ef1 m\u00e0u nhi\u1ec7m (linh thi\u00eang, linh \u1ee9ng,..), s\u1ef1 lanh l\u1ee3i, ho\u1ea1t b\u00e1t (linh ho\u1ea1t,...). \r\nNh\u1eadt Linh l\u00e0 t\u00ean \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i v\u1edbi \u00fd nghi\u0303a mong con s\u1ebd lu\u00f4n xinh \u0111\u1eb9p lung linh v\u00e0 to\u1ea3 s\u00e1ng, th\u00f4ng minh nh\u01b0 m\u1eb7t tr\u1eddi.\"", "sex": 7}
{"first_name": "Nhi Linh", "meaning": "\"Nhi\" l\u00e0 b\u00e9 nh\u1ecf, \"Linh\" l\u00e0 linh thi\u00eang, m\u00e0u nhi\u1ec7m. T\u00ean \"Nhi Linh\" c\u00f3 ngh\u0129a: thi\u00ean th\u1ea7n b\u00e9 nh\u1ecf mang v\u1eadn may \u0111\u1ebfn cho gia \u0111\u00ecnh.", "sex": 5}
{"first_name": "Phong Linh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, ch\u1eef \"Linh\" ngh\u0129a l\u00e0 trong s\u00e1ng, s\u00e1ng s\u1ee7a, \u00eam \u1ea3, nh\u1eb9 nh\u00e0ng, \"Phong\" ngh\u0129a l\u00e0 gi\u00f3. \"Linh Phong\" ngh\u0129a l\u00e0 gi\u00f3 nh\u1eb9, gi\u00f3 hiu hiu -  nh\u1eefng c\u01a1n gi\u00f3 \u0111\u1ec1u \u0111\u1ec1u \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi r\u1ea5t th\u00edch, v\u00ec n\u00f3 \u0111em l\u1ea1i cho ng\u01b0\u1eddi ta c\u1ea3m gi\u00e1c tho\u1ea3i m\u00e1i, d\u1ec5 ch\u1ecbu. T\u00ean \"Linh Phong\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng con ng\u01b0\u1eddi c\u00f3 di\u1ec7n m\u1ea1o kh\u00f4i ng\u00f4, nhanh nh\u1eb9n nh\u01b0 nh\u1eefng c\u01a1n gi\u00f3, c\u00f3 t\u00e0i giao ti\u1ebfp, l\u00e0m ng\u01b0\u1eddi \u0111\u1ed1i di\u1ec7n c\u1ea3m th\u1ea5y tho\u1ea3i m\u00e1i, vui v\u1ebb. Nh\u1eefng ng\u01b0\u1eddi n\u00e0y th\u01b0\u1eddng \u0111\u01b0\u1ee3c y\u00eau m\u1ebfn v\u00e0 lu\u00f4n nh\u1eadn \u0111\u01b0\u1ee3c ni\u1ec1m tin t\u1eeb m\u1ecdi ng\u01b0\u1eddi.", "sex": 3}
{"first_name": "Ph\u01b0\u01a1ng Linh", "meaning": "\"Ph\u01b0\u01a1ng\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m d\u1ecbu d\u00e0ng c\u1ee7a c\u1ecf hoa. \"Linh\" c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u1eb9n, th\u00f4ng minh, lanh l\u1ee3i. T\u00ean \"Ph\u01b0\u01a1ng Linh\" l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p lung linh nh\u01b0 m\u1ed9t b\u00f4ng hoa th\u01a1m & v\u1eeba th\u00f4ng minh v\u1eeba lanh l\u1ee3i.", "sex": 5}
