{"first_name": "Th\u00f9y Linh", "meaning": "\"Th\u00f9y\" l\u00e0 t\u00ean \u0111\u1ec7m, c\u00f3 ngh\u0129a l\u00e0 th\u00f9y m\u1ecb, \"Linh\" l\u00e0 th\u00f4ng minh, lanh l\u1ee3i. \"Th\u00f9y Linh\" mang \u00fd ngh\u0129a con l\u00e0 c\u00f4 g\u00e1i xinh \u0111\u1eb9p, th\u00f4ng minh lanh l\u1ee3i, th\u00f9y m\u1ecb \u0111\u00e1ng y\u00eau.", "sex": 5}
{"first_name": "Tr\u00fac Linh", "meaning": "Tr\u00fac c\u00f3 ngh\u0129a l\u00e0 c\u00e2y tr\u00fac, l\u00e0 1 trong b\u1ed9 t\u1ee9 qu\u00fd T\u1ee9 qu\u00e2n T\u1eed hoa: T\u00f9ng, C\u00fac, Tr\u00fac, Mai. C\u00e2y tr\u00fac lu\u00f4n \u0111\u1ee9ng th\u1eb3ng v\u00e0 s\u1ed1ng \u0111\u01b0\u1ee3c \u1edf kh\u1eafp n\u01a1i d\u00f9 l\u00e0 \u0111\u1ea5t c\u1eb1n c\u1ed5i v\u00ec v\u1eady \u0111\u01b0\u1ee3c t\u00f4n tr\u1ecdng l\u00e0 c\u00f3 t\u00ednh c\u00e1ch \u201cqu\u00e2n t\u1eed\u201d. Linh c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, lanh l\u1ee3i & xinh \u0111\u1eb9p. C\u00f3 th\u1ec3 n\u00f3i Tr\u00fac Linh l\u00e0 c\u00e2y tr\u00fac linh thi\u00eang trong h\u1ec7 c\u00e2y thi\u00ean m\u1ec7nh qu\u00fd hi\u1ebfm v\u1edbi ng\u1ee5 \u00fd ng\u01b0\u1eddi s\u1ed1ng th\u1eb3ng ngay, c\u00f3 t\u00e2m h\u1ed3n \u0111\u1eb9p, thanh cao & dung m\u1ea1o xinh \u0111\u1eb9p, thu h\u00fat", "sex": 5}
