{"first_name": "\u0110\u00e0o Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen, lo\u00e0i hoa t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 thanh khi\u1ebft, trong s\u1ea1ch. Trong v\u0103n h\u00f3a c\u1ee7a ng\u01b0\u1eddi Vi\u1ec7t Nam, th\u01b0\u1eddng ch\u00fa tr\u1ecdng \u0111\u1ebfn \u00fd ngh\u0129a c\u1ee7a hoa \u0110\u00e0o. H\u00ecnh \u1ea3nh hoa \u0111\u00e0o g\u1eafn v\u1edbi nh\u1eefng c\u00f4 g\u00e1i tr\u1ebb m\u1ea3nh mai xinh \u0111\u1eb9p. V\u00ec th\u1ebf \"\u0110\u00e0o Li\u00ean\" mang \u00fd ngh\u0129a con xinh \u0111\u1eb9p, tr\u1ebb trung, thanh m\u1ea3nh, c\u1ea7n \u0111\u01b0\u1ee3c y\u00eau th\u01b0\u01a1ng ch\u0103m s\u00f3c nh\u01b0 lo\u00e0i hoa \u0111\u1eb9p n\u1edf v\u00e0o m\u00f9a xu\u00e2n", "sex": 5}
{"first_name": "Di Li\u00ean", "meaning": "\"Li\u00ean\" ph\u00e0m \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 t\u00e2m t\u00ednh thanh t\u1ecbnh, s\u1ed1ng ngay th\u1eb3ng, kh\u00f4ng v\u1ea9n \u0111\u1ee5c b\u1edfi nh\u1eefng phi\u1ec1n n\u00e3o c\u1ee7a s\u1ef1 \u0111\u1eddi, ph\u1ea9m ch\u1ea5t thanh cao, bi\u1ebft ki\u00ean nh\u1eabn, ch\u1ecbu th\u01b0\u01a1ng ch\u1ecbu kh\u00f3, m\u1ea1nh m\u1ebd sinh t\u1ed3n \u0111\u1ec3 v\u01b0\u01a1n vai gi\u1eefa \u0111\u1ea5t tr\u1eddi v\u1edbi t\u1ea5m l\u00f2ng b\u00e1c \u00e1i, bao dung. \"Di\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 vui v\u1ebb, sung s\u01b0\u1edbng. V\u00ec v\u1eady \"Di Li\u00ean\" th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean, gi\u1ea3n d\u1ecb, h\u1ea1nh ph\u00fac, lu\u00f4n \u0111\u1ea7y \u1eafp ni\u1ec1m vui v\u00e0 ti\u1ebfng c\u01b0\u1eddi.", "sex": 5}
{"first_name": "Di\u1ec5m Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen. Di\u1ec5m l\u00e0 \u0111\u1eb9p di\u1ec5m l\u1ec7. Di\u1ec5n li\u00ean l\u00e0 con \u0111\u1eb9p di\u1ec5m l\u1ec7, t\u00e2m t\u00ednh thanh cao & thu\u1ea7n khi\u1ebft nh\u01b0 hoa sen", "sex": 5}
{"first_name": "Di\u00ean Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen, lo\u00e0i hoa t\u01b0\u1ee3ng tr\u01b0ng cho ng\u01b0\u1eddi c\u00f3 t\u00e2m t\u00ednh s\u1ed1ng ngay th\u1eb3ng, kh\u00f4ng v\u1ea9n \u0111\u1ee5c b\u1edfi nh\u1eefng phi\u1ec1n n\u00e3o c\u1ee7a s\u1ef1 \u0111\u1eddi, ph\u1ea9m ch\u1ea5t thanh cao, bi\u1ebft ki\u00ean nh\u1eabn, ch\u1ecbu th\u01b0\u01a1ng ch\u1ecbu kh\u00f3, m\u1ea1nh m\u1ebd sinh t\u1ed3n \u0111\u1ec3 v\u01b0\u01a1n vai gi\u1eefa \u0111\u1ea5t tr\u1eddi v\u1edbi t\u1ea5m l\u00f2ng b\u00e1c \u00e1i, bao dung. \"Di\u00ean\" theo ngh\u0129a H\u00e1n Vi\u1ec7t ch\u00ednh l\u00e0 ch\u1ec9 t\u00ean c\u1ee7a chim \u01b0ng, chim \u00f3. \"Di\u00ean Li\u00ean\" th\u1ec3 hi\u1ec7n d\u00e1ng v\u1ebb c\u1ee7a ng\u01b0\u1eddi anh h\u00f9ng v\u1eb9n to\u00e0n v\u1edbi tr\u00e1i tim c\u1ee7a hoa sen. T\u00ean c\u1ee7a lo\u00e0i chim n\u00e0y kh\u00e1 hay g\u1eb7p trong danh t\u1eeb ri\u00eang ch\u1ec9 ng\u01b0\u1eddi, v\u00ec chim \u00f3 l\u00e0 lo\u00e0i chim bay r\u1ea5t cao, r\u1ea5t d\u0169ng m\u00e3nh v\u00e0 r\u1ea5t \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u00edch.", "sex": 3}
{"first_name": "Di\u1ec7p Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen, lo\u00e0i hoa t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 thanh khi\u1ebft, trong s\u1ea1ch, d\u00f9 m\u1ecdc l\u00ean t\u1eeb b\u00f9n nh\u01a1 nh\u01b0ng kh\u00f4ng h\u1ec1 h\u00f4i tanh, v\u1eabn khoe s\u1eafc, ng\u00e1t h\u01b0\u01a1ng, \u0111\u1eb9p d\u1ecbu d\u00e0ng. Theo ti\u1ebfng H\u00e1n- Vi\u1ec7t l\u00e0 ch\u1eef \"Di\u1ec7p\" ch\u00ednh l\u00e0 \"l\u00e1\" trong Kim Chi Ng\u1ecdc Di\u1ec7p (d\u1ecbch l\u00e0 c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc). V\u00ec v\u1eady, \"Di\u1ec7p Chi\" th\u1ec3 hi\u1ec7n v\u1ebb \u0111\u1eb9p tinh khi\u1ebft, quy\u1ec1n qu\u00fd, sang gi\u00e0u, d\u00f2ng d\u00f5i danh gi\u00e1.", "sex": 5}
{"first_name": "\u0110i\u1ec7p Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen, lo\u00e0i hoa t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 thanh khi\u1ebft, trong s\u1ea1ch, c\u00f2n \"\u0110i\u1ec7p\" l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng con b\u01b0\u1edbm. \"\u0110i\u1ec7p Li\u00ean\" l\u00e0 ch\u1ec9 ng\u01b0\u1eddi xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau, thu h\u00fat, t\u1ea1o c\u1ea3m gi\u00e1c vui t\u01b0\u01a1i, thanh th\u1ea3n.", "sex": 5}
{"first_name": "Di\u1ec7u Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen, lo\u00e0i hoa t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 thanh khi\u1ebft, trong s\u1ea1ch, \u0111\u1eb9p d\u1ecbu d\u00e0ng. \"Di\u1ec7u\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1eb9p, l\u00e0 tuy\u1ec7t di\u1ec7u, \u00fd ch\u1ec9 nh\u1eefng \u0111i\u1ec1u tuy\u1ec7t v\u1eddi \u0111\u01b0\u1ee3c t\u1ea1o n\u00ean b\u1edfi s\u1ef1 kh\u00e9o l\u00e9o, k\u00ec di\u1ec7u. \"Li\u00ean Di\u1ec7u\" l\u00e0 v\u1ebb \u0111\u1eb9p mang l\u1ea1i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0ng v\u1eabn cu\u1ed1n h\u00fat, \u1ea5n t\u01b0\u1ee3ng n\u00ean th\u01b0\u1eddng ph\u00f9 h\u1ee3p \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i.", "sex": 5}
{"first_name": "D\u0129nh Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen, lo\u00e0i hoa t\u01b0\u1ee3ng tr\u01b0ng cho n\u00e9t \u0111\u1eb9p thanh khi\u1ebft, trong s\u1ea1ch, d\u1ecbu d\u00e0ng. \"D\u0129nh\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 ng\u00f2i b\u00fat, s\u1ef1 th\u00f4ng minh h\u01a1n ng\u01b0\u1eddi. \"D\u0129nh Li\u00ean\" l\u00e0m ng\u01b0\u1eddi ta li\u00ean t\u01b0\u1edfng t\u1edbi h\u00ecnh \u1ea3nh ng\u01b0\u1eddi con g\u00e1i t\u00e0i s\u1eafc v\u1eb9n to\u00e0n", "sex": 5}
{"first_name": "\u0110\u00ecnh Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen, lo\u00e0i hoa t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 thanh khi\u1ebft, trong s\u1ea1ch, d\u00f9 m\u1ecdc l\u00ean t\u1eeb b\u00f9n nh\u01a1 nh\u01b0ng kh\u00f4ng h\u1ec1 h\u00f4i tanh, v\u1eabn khoe s\u1eafc, ng\u00e1t h\u01b0\u01a1ng, \u0111\u1eb9p d\u1ecbu d\u00e0ng. \"\u0110\u00ecnh\" trong H\u00e1n Vi\u1ec7t c\u00f2n c\u00f3 ngh\u0129a l\u00e0 \u1ed5n th\u1ecfa, th\u1ecfa \u0111\u00e1ng, th\u1ec3 hi\u1ec7n s\u1ef1 s\u1eafp x\u1ebfp \u00eam \u1ea5m. \"\u0110\u00ecnh Li\u00ean\" li\u00ean t\u01b0\u1edfng t\u1edbi h\u00ecnh \u1ea3nh ng\u01b0\u1eddi ph\u1ee5 n\u1eef c\u1ee7a gia \u0111\u00ecnh, gi\u00fap gia \u0111\u00ecnh trong \u1ea5m ngo\u00e0i \u00eam.", "sex": 5}
{"first_name": "\u0110\u1ecbnh Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen, lo\u00e0i hoa t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 thanh khi\u1ebft, d\u1ecbu d\u00e0ng. \"\u0110\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 ki\u00ean \u0111\u1ecbnh, kh\u00f4ng \u0111\u1ed5i d\u1eddi, b\u1ea5t bi\u1ebfn. \"\u0110\u1ecbnh Li\u00ean\" t\u1ef1a nh\u01b0 t\u00ednh ch\u1ea5t lo\u00e0i hoa thanh cao, nh\u01b0ng ki\u00ean \u0111\u1ecbnh, kh\u00f4ng bao gi\u1edd thay \u0111\u1ed5i.", "sex": 5}
