{"first_name": "Doanh Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen, lo\u00e0i hoa t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 thanh khi\u1ebft, trong s\u1ea1ch, n\u00e9t \u0111\u1eb9p d\u1ecbu d\u00e0ng. \"Doanh\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 \u0111\u1ea7y \u0111\u1ee7, r\u1ed9ng l\u1edbn, b\u1ec3 c\u1ea3, ng\u1ee5 \u00fd con ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng kho\u00e1ng \u0111\u1ea1t r\u1ed9ng r\u00e3i, \u0111\u1ee9c \u0111\u1ed9, t\u00e0i n\u0103ng. V\u00ec v\u1eady \"Doanh Li\u00ean\" to\u00e1t l\u00ean h\u00ecnh \u1ea3nh ng\u01b0\u1eddi con g\u00e1i c\u00f3 v\u1ebb \u0111\u1eb9p c\u1ee7a m\u1ed9t lo\u00e0i hoa, l\u1ea1i c\u00f3 t\u1ea5m l\u00f2ng c\u1ee7a m\u1ed9t ng\u01b0\u1eddi anh h\u00f9ng.", "sex": 5}
{"first_name": "\u0110\u00f4ng Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen, lo\u00e0i hoa t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 thanh khi\u1ebft, thanh cao. \"\u0110\u00f4ng\" l\u00e0 m\u00f9a \u0111\u00f4ng, khi\u1ebfn con ng\u01b0\u1eddi nh\u1edb \u0111\u1ebfn c\u1ea3m gi\u00e1c \u1ea5m \u00e1p, sum v\u1ea7y b\u00ean nh\u1eefng ng\u01b0\u1eddi th\u00e2n y\u00eau. \"\u0110\u00f4ng Li\u00ean\" l\u00e0 hi\u1ec7n th\u00e2n c\u1ee7a m\u1ed9t ng\u01b0\u1eddi ph\u1ee5 n\u1eef h\u1ebft l\u00f2ng v\u00ec gia \u0111\u00ecnh.", "sex": 5}
{"first_name": "Du Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen, lo\u00e0i hoa thanh cao, tinh khi\u1ebft. \"Du\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 hay \u0111i \u0111\u1ed9ng, kh\u00f4ng \u1edf ch\u1ed7 nh\u1ea5t \u0111\u1ecbnh. V\u00ec v\u1eady, khi \u0111\u1eb7t t\u00ean n\u00e0y cho con, b\u1ed1 m\u1eb9 mong mu\u1ed1n con m\u00ecnh ngo\u00e0i v\u1ebb \u0111\u1eb9p cao qu\u00fd, c\u00f2n c\u00f3 cu\u1ed9c s\u1ed1ng s\u00f4i \u0111\u1ed9ng, \u0111\u1ea7y m\u00e0u s\u1eafc, c\u00f3 th\u1ec3 \u0111i ngao du \u0111\u00e2y \u0111\u00f3, kh\u00e1m ph\u00e1 kh\u1eafp n\u01a1i.", "sex": 5}
{"first_name": "D\u0169 Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen, lo\u00e0i hoa t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 thanh khi\u1ebft, cao qu\u00fd, kh\u00f4ng v\u1ea9n \u0111\u1ee5c b\u1edfi nh\u1eefng phi\u1ec1n n\u00e3o c\u1ee7a s\u1ef1 \u0111\u1eddi, ph\u1ea9m ch\u1ea5t thanh cao. \"D\u0169\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u1ed1t h\u01a1n, m\u1edf mang th\u00eam, h\u00e0m ngh\u0129a con ng\u01b0\u1eddi th\u1eadp to\u00e0n, lu\u00f4n b\u1ed3i b\u1ed5 tri th\u1ee9c, t\u00ednh c\u00e1ch. \"D\u0169 Li\u00ean\" th\u1ec3 hi\u1ec7n m\u1ed9t con ng\u01b0\u1eddi v\u1edbi v\u1ebb \u0111\u1eb9p cao qu\u00fd v\u00e0 say m\u00ea t\u00ecm t\u00f2i, kh\u00e1m ph\u00e1.", "sex": 5}
