{"first_name": "H\u1ea3o Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen, lo\u00e0i hoa t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 thanh khi\u1ebft, trong s\u1ea1ch, ng\u00e1t h\u01b0\u01a1ng, \u0111\u1eb9p d\u1ecbu d\u00e0ng. \"H\u1ea3o\" b\u1eaft ngu\u1ed3n t\u1eeb ti\u1ebfng H\u00e1n, c\u00f3 ngh\u0129a l\u00e0 t\u1ed1t l\u00e0nh, t\u1ed1t \u0111\u1eb9p. \"H\u1ea3o Li\u00ean\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con c\u00e1i v\u1edbi mong mu\u1ed1n con s\u1ebd tr\u1edf th\u00e0nh ng\u01b0\u1eddi xinh \u0111\u1eb9p, gi\u1ecfi giang, kh\u00e9o l\u00e9o.", "sex": 5}
