{"first_name": "Hi\u1ec3u Li\u00ean", "meaning": "Hi\u1ec3u Li\u00ean l\u00e0 b\u00f4ng sen n\u1edf s\u1edbm, ng\u1ee5 \u00fd ng\u01b0\u1eddi con g\u00e1i thanh tao \u0111\u1eb9p \u0111\u1ebd", "sex": 7}
{"first_name": "Hoa Li\u00ean", "meaning": "\"Hoa Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen. T\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 thanh khi\u1ebft, trong s\u1ea1ch. T\u00ean n\u00e0y c\u00f3 ngh\u0129a con l\u00e0 ng\u01b0\u1eddi c\u00f3 t\u00e2m t\u00ednh thanh t\u1ecbnh, s\u1ed1ng ngay th\u1eb3ng, kh\u00f4ng v\u1eabn \u0111\u1ee5c b\u1edfi nh\u1eefng phi\u1ec1n n\u00e3o c\u1ee7a s\u1ef1 \u0111\u1eddi, ph\u1ea9m ch\u1ea5t thanh cao, bi\u1ebft ki\u00ean nh\u1eabn ch\u1ecbu th\u01b0\u01a1ng ch\u1ecbu kh\u00f3, m\u1ea1nh m\u1ebd sinh t\u1ed3n \u0111\u1ec3 v\u01b0\u01a1n vai gi\u1eefa \u0111\u1ea5t tr\u1eddi v\u1edbi t\u1ea5m l\u00f2ng b\u00e1c \u00e1i, bao dung.", "sex": 5}
{"first_name": "H\u00f2a Li\u00ean", "meaning": "\"H\u00f2a Li\u00ean\" ng\u1ee5 \u00fd ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i c\u00f3 v\u1ebb \u0111\u1eb9p c\u1ee7a s\u1ef1 thanh khi\u1ebft, trong s\u1ea1ch, d\u00f9 m\u1ecdc l\u00ean t\u1eeb b\u00f9n nh\u01a1 nh\u01b0ng kh\u00f4ng h\u1ec1 h\u00f4i tanh, v\u1eabn khoe s\u1eafc, ng\u00e1t h\u01b0\u01a1ng, \u0111\u1eb9p d\u1ecbu d\u00e0ng v\u00e0 \u0111\u1ee9c t\u00ednh con ng\u01b0\u1eddi, hi\u1ec1n l\u00e0nh, th\u00e1i \u0111\u1ed9 t\u1eeb t\u1ed1n, m\u1ec1m m\u1ecfng, ng\u00f4n ng\u1eef nh\u1ecf nh\u1eb9, \u00f4n h\u00f2a.", "sex": 5}
{"first_name": "Ho\u00e0ng Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen. Ho\u00e0ng l\u00e0 m\u00e0u v\u00e0ng. Ho\u00e0ng Li\u00ean c\u00f3 ngh\u0129a con xinh \u0111\u1eb9p, thu\u1ea7n khi\u1ebft, thanh cao, qu\u00fd gi\u00e1 nh\u01b0 hoa sen v\u00e0ng", "sex": 5}
{"first_name": "H\u1ed3ng Li\u00ean", "meaning": "\"H\u1ed3ng Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen h\u1ed3ng. D\u1ef1a tr\u00ean h\u00ecnh \u1ea3nh c\u1ee7a hoa sen, t\u00ean \"H\u1ed3ng Li\u00ean\" ph\u00e0m \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 t\u00e2m t\u00ednh thanh t\u1ecbnh, s\u1ed1ng ngay th\u1eb3ng, kh\u00f4ng v\u1eabn \u0111\u1ee5c b\u1edfi nh\u1eefng phi\u1ec1n n\u00e3o c\u1ee7a s\u1ef1 \u0111\u1eddi, ph\u1ea9m ch\u1ea5t thanh cao, bi\u1ebft ki\u00ean nh\u1eabn ch\u1ecbu th\u01b0\u01a1ng ch\u1ecbu kh\u00f3, m\u1ea1nh m\u1ebd sinh t\u1ed3n \u0111\u1ec3 v\u01b0\u01a1n vai gi\u1eefa \u0111\u1ea5t tr\u1eddi v\u1edbi t\u1ea5m l\u00f2ng b\u00e1c \u00e1i, bao dung.", "sex": 5}
{"first_name": "Hu\u1ec7 Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen, lo\u00e0i hoa t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 thanh khi\u1ebft, trong s\u1ea1ch. Hu\u1ec7 l\u00e0 t\u00ean 1 lo\u00e0i hoa \u0111\u1eb7c bi\u1ec7t t\u1ecfa h\u01b0\u01a1ng ng\u00e0o ng\u1ea1t v\u1ec1 \u0111\u00eam, mang \u00fd ngh\u0129a thanh khi\u1ebft, thanh cao, trong s\u1ea1ch. \"Hu\u1ec7 Li\u00ean\" cha m\u1eb9 mong con s\u1ed1ng khi\u00eam nh\u01b0\u1eddng, t\u00e2m h\u1ed3n thanh cao, trong s\u1ea1ch nh\u01b0 ch\u00ednh lo\u00e0i hoa sen, hoa hu\u1ec7.", "sex": 5}
{"first_name": "H\u1eefu Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen. H\u1eefu l\u00e0 c\u00f3 \u00edch. H\u1eefu Li\u00ean c\u00f3 ngh\u0129a con xinh \u0111\u1eb9p, trong s\u00e1ng, thanh cao, l\u00e0 ng\u01b0\u1eddi c\u00f3 \u00edch cho cu\u1ed9c \u0111\u1eddi", "sex": 7}
{"first_name": "Kim Li\u00ean", "meaning": "\"Kim\" c\u00f3 ngh\u0129a l\u00e0 v\u00e0ng ,c\u00f2n \"Li\u00ean\" l\u00e0 hoa sen, bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a s\u1ef1 thanh cao, trong s\u00e1ng v\u00f4 ng\u1ea7n. T\u00ean \"Kim Li\u00ean\" h\u00e0m \u00fd con l\u00e0 ng\u01b0\u1eddi c\u00f3 l\u00e0 b\u00f4ng hoa qu\u00fd b\u00e1u c\u1ee7a b\u1ed1 m\u1eb9, c\u00f3 t\u00e2m h\u1ed3n \u0111\u00f4n h\u1eadu, t\u00ednh c\u00e1ch thanh khi\u1ebft, s\u00e1ng trong, l\u00f2ng d\u1ea1 ki\u00ean \u0111\u1ecbnh", "sex": 5}
{"first_name": "Ph\u00fa S\u1ed5", "meaning": "\"Ph\u00fa\" l\u00e0 gi\u00e0u sang. \"Ph\u00fa S\u1ed5\" l\u00e0 c\u00e2n nh\u1eafc gi\u00e0u sang, ch\u1ec9 con ng\u01b0\u1eddi th\u1eadn tr\u1ecdng t\u1ec9 m\u1ec9, bi\u1ebft t\u00ednh to\u00e1n li\u1ec7u \u0111\u1ecbnh.", "sex": 3}
