{"first_name": "B\u1ea3o \u00dd", "meaning": "Ch\u1eef \"B\u1ea3o\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. V\u00ec v\u1eady, t\u00ean \"B\u1ea3o\"th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con nh\u01b0 h\u00e0m \u00fd con ch\u00ednh l\u00e0 b\u1ea3o v\u1eadt m\u00e0 b\u1ed1 m\u1eb9 lu\u00f4n n\u00e2ng niu, gi\u1eef g\u00ecn.  \"B\u1ea3o \u00dd\" mang \u00fd ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 cu\u1ed9c s\u1ed1ng \u1ea5m \u00eam lu\u00f4n \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng.", "sex": 5}
{"first_name": "\u0110an \u00dd", "meaning": "\"\u0110an\" l\u00e0 ng\u01b0\u1eddi gi\u1ea3n d\u1ecb, trong s\u00e1ng. \"\u0110an \u00dd\" - con l\u00e0 ng\u01b0\u1eddi trong s\u00e1ng, c\u00f3 cu\u1ed9c s\u1ed1ng gi\u1ea3n d\u1ecb nh\u01b0ng m\u1ea1nh m\u1ebd bi\u1ebft ph\u1ea5n \u0111\u1ea5u d\u1ed3n s\u1ee9c l\u1ef1c h\u01b0\u1edbng \u0111\u1ebfn s\u1ef1 th\u00e0nh c\u00f4ng.", "sex": 5}
{"first_name": "\u0110\u1ea1t \u00dd", "meaning": "\"\u0110\u1ea1t\" trong ti\u1ebfng H\u00e1n th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 v\u1ec1 s\u1ef1 th\u00e0nh c\u00f4ng, v\u1ecb th\u1ebf cao sang, tr\u00ed tu\u1ec7 th\u00f4ng su\u1ed1t, th\u1ea5u t\u00ecnh \u0111\u1ea1t l\u00fd c\u1ee7a con ng\u01b0\u1eddi. T\u00ean \"\u0110\u1ea1t \u00dd\" mang \u00fd ngh\u0129a con s\u1ebd l\u00e0 ng\u01b0\u1eddi tr\u00ed tu\u1ec7, c\u00f3 hi\u1ebfu bi\u1ebft v\u00e0 th\u00e0nh c\u00f4ng, \u0111\u1ed7 \u0111\u1ea1t trong s\u1ef1 nghi\u1ec7p theo nh\u01b0 \u00fd nguy\u1ec7n.", "sex": 3}
{"first_name": "Di\u1ec5m \u00dd", "meaning": "\"Di\u1ec5m\" theo ti\u1ebfng h\u00e1n - vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u1ed1t \u0111\u1eb9p, v\u1ebb t\u01b0\u01a1i s\u00e1ng, xinh \u0111\u1eb9p l\u1ed9ng l\u1eaby th\u01b0\u1eddng ng\u1ee5 \u00fd ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p, y\u1ec3u \u0111i\u1ec7u. \"Di\u1ec5m \u00dd\" l\u00e0 \u00fd nguy\u1ec7n \u0111\u01b0\u1ee3c nh\u01b0 \u00fd, c\u00f3 \u0111\u01b0\u1ee3c nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p nh\u01b0 \u00fd mu\u1ed1n.", "sex": 5}
{"first_name": "Di\u1ec7p \u00dd", "meaning": "Theo ti\u1ebfng H\u00e1n- Vi\u1ec7t l\u00e0 ch\u1eef \"Di\u1ec7p\" ch\u00ednh l\u00e0 \"l\u00e1\" trong Kim Chi Ng\u1ecdc Di\u1ec7p (d\u1ecbch l\u00e0 c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc). \"Di\u1ec7p \u00dd\" ng\u1ee5  \u00fd mu\u1ed1n n\u00f3i con nh\u00e0 quy\u1ec1n qu\u00fd sang gi\u00e0u, d\u00f2ng d\u00f5i danh gi\u00e1. B\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n th\u1ec3 hi\u1ec7n mong mu\u1ed1n t\u1ed1t \u0111\u1eb9p c\u1ee7a b\u1ed1 m\u1eb9 mong con gi\u00e0u sang v\u00e0 lu\u00f4n c\u00f3 \u00fd ch\u00ed h\u01a1n ng\u01b0\u1eddi.", "sex": 5}
{"first_name": "Di\u1ec7u \u00dd", "meaning": "\"Di\u1ec7u\" l\u00e0 \u0111\u1eb9p, l\u00e0 \u0111i\u1ec1u tuy\u1ec7t di\u1ec7u. V\u1edbi t\u00ean \"Di\u1ec7u \u00dd\" ba m\u1eb9 mong mu\u1ed1n con xinh \u0111\u1eb9p, lu\u1ed1n h\u01b0\u1edbng \u0111\u1ebfn nh\u1eefng \u0111i\u1ec1u tuy\u1ec7t di\u1ec7u, k\u1ef3 di\u1ec7u b\u1eb1ng quy\u1ebft t\u00e2m v\u00e0 n\u1ed7 l\u1ef1c c\u1ee7a b\u1ea3n th\u00e2n.", "sex": 5}
{"first_name": "Duy \u00dd", "meaning": "\"Duy\" trong ti\u1ebfng H\u00e1n c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u01b0 duy, suy ngh\u0129 th\u1ea5u \u0111\u00e1o. \"Duy \u00dd\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi lu\u00f4n b\u00ecnh t\u0129nh gi\u1ea3i quy\u1ebft v\u1ea5n \u0111\u1ec1 kh\u00f4ng b\u1ed9p ch\u1ed9p h\u00e0nh x\u1eed, c\u00f3 tr\u00ed tu\u1ec7, th\u00f4ng minh tinh t\u01b0\u1eddng, lu\u00f4n bi\u1ebft b\u1ea3o v\u1ec7 v\u00e0 tin t\u01b0\u1edfng v\u00e0o \u00fd ki\u1ebfn c\u1ee7a m\u00ecnh.", "sex": 3}
{"first_name": "Gia \u00dd", "meaning": "\"Gia\" trong ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f2n l\u00e0 gia \u0111\u00ecnh, l\u00e0 m\u00e1i nh\u00e0 n\u01a1i m\u1ecdi ng\u01b0\u1eddi sum v\u1ea7y, sinh ho\u1ea1t b\u00ean nhau. Ngo\u00e0i ra ch\u1eef \"Gia\" c\u00f2n c\u00f3 ngh\u0129 l\u00e0 xinh \u0111\u1eb9p, \u01b0u t\u00fa, mang ph\u1ea9m ch\u1ea5t cao qu\u00fd. \"Gia \u00dd\" mang \u00fd ngh\u0129a con l\u00e0 ni\u1ec1m vui, l\u00e0 \u00fd nguy\u1ec7n c\u1ee7a gia \u0111\u00ecnh, mang \u0111\u1ebfn cho c\u1ea3 nh\u00e0 nhi\u1ec1u ti\u1ebfng c\u01b0\u1eddi h\u1ea1nh ph\u00fac.", "sex": 5}
{"first_name": "H\u00e0 \u00dd", "meaning": "\"H\u00e0\" l\u00e0 con s\u00f4ng. \"H\u00e0 \u00dd\" - con l\u00e0 ng\u01b0\u1eddi c\u00f3 \u00fd ch\u00ed ho\u00e0i b\u00e3o l\u1edbn nh\u01b0 con s\u00f4ng, lu\u00f4n m\u00e3nh li\u1ec7t v\u00e0 kh\u00f4ng ng\u1eebng ph\u1ea5n \u0111\u1ea5u.", "sex": 5}
{"first_name": "H\u1ea3i \u00dd", "meaning": "\"H\u1ea3i\" l\u00e0 bi\u1ec3n. \"H\u1ea3i \u00dd\" mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi m\u1ea1nh m\u1ebd nh\u01b0 bi\u1ec3n c\u1ea3 v\u00e0 c\u00f3 tr\u00ed tu\u1ec7 v\u00e0 l\u00e0 ng\u01b0\u1eddi s\u1ed1ng c\u00f3 l\u00fd t\u01b0\u1edfng c\u00f3 t\u00e2m huy\u1ebft \u0111\u1ec3 \u0111\u1ea1t \u0111\u01b0\u1ee3c \u0111i\u1ec1u m\u00ecnh mong mu\u1ed1n.", "sex": 5}
{"first_name": "Hi\u1ec1n \u00dd", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, khi n\u00f3i v\u1ec1 ng\u01b0\u1eddi th\u00ec \"Hi\u1ec1n\" c\u00f3 ngh\u0129a l\u00e0 t\u1ed1t l\u00e0nh, c\u00f3 t\u00e0i c\u00f3 \u0111\u1ee9c. T\u00ean \"Hi\u1ec1n\" ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 t\u00ednh \u00f4n h\u00f2a, \u0111\u1eb1m th\u1eafm, d\u00e1ng v\u1ebb, c\u1eed ch\u1ec9 nh\u1eb9 nh\u00e0ng, th\u00e2n thi\u1ec7n, c\u00f3 t\u00e0i n\u0103ng & \u0111\u1ee9c h\u1ea1nh. \"Hi\u1ec1n \u00dd\" mang \u00fd ngh\u0129a con l\u00e0 ng\u01b0\u1eddi con g\u00e1i d\u1ecbu d\u00e0ng, nh\u1eb9 nh\u00e0ng, lu\u00f4n t\u00e2m l\u00fd v\u00e0 hi\u1ec3u bi\u1ebft, \u00f4n h\u00f2a, nh\u00e3 nh\u1eb5n v\u1edbi m\u1ecdi ng\u01b0\u1eddi.", "sex": 5}
{"first_name": "H\u00f2a \u00dd", "meaning": "\"H\u00f2a\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 \u00eam \u1ea5m, y\u00ean \u1ed5n ch\u1ec9 s\u1ef1 thu\u1eadn h\u1ee3p. T\u00ean \"H\u00f2a \u00dd\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 v\u1ec1 \u0111\u1ee9c t\u00ednh con ng\u01b0\u1eddi, hi\u1ec1n l\u00e0nh, th\u00e1i \u0111\u1ed9 t\u1eeb t\u1ed1n, m\u1ec1m m\u1ecfng, ng\u00f4n ng\u1eef nh\u1ecf nh\u1eb9, \u00f4n h\u00f2a.", "sex": 5}
{"first_name": "Ho\u00e0ng \u00dd", "meaning": "\"Ho\u00e0ng\" trong ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 m\u00e0u v\u00e0ng, \u00e1nh s\u1eafc c\u1ee7a v\u00e0ng v\u00e0 \u1edf m\u1ed9t ngh\u0129a kh\u00e1c th\u00ec \"Ho\u00e0ng\" th\u1ec3 hi\u1ec7n s\u1ef1 nghi\u00eam trang, r\u1ef1c r\u1ee1,huy ho\u00e0ng nh\u01b0 b\u1eadc vua ch\u00faa. T\u00ean \"Ho\u00e0ng\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi v\u0129 \u0111\u1ea1i, c\u00f3 c\u1ed1t c\u00e1ch v\u01b0\u01a1ng gi\u1ea3, v\u1edbi mong mu\u1ed1n t\u01b0\u01a1ng lai ph\u00fa qu\u00fd, sang gi\u00e0u. \"Ho\u00e0ng \u00dd\" th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi c\u00f3 s\u1ee9c m\u1ea1nh v\u00e0 \u00fd ch\u00ed m\u1ea1nh m\u1ebd, lu\u00f4n h\u1ebft m\u00ecnh v\u00ec m\u1ee5c ti\u00eau, mong mu\u1ed1n \u0111\u1ec3 h\u01b0\u1edbng \u0111\u1ebfn cu\u1ed9c s\u1ed1ng ph\u00fa qu\u00fd.", "sex": 5}
{"first_name": "H\u1ed3ng \u00dd", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"H\u1ed3ng\" l\u00e0 \u00fd ch\u1ec9 m\u00e0u \u0111\u1ecf , m\u00e0 m\u00e0u \u0111\u1ecf v\u1ed1n th\u1ec3 hi\u1ec7n cho ni\u1ec1m vui, s\u1ef1 may m\u1eafn, c\u00e1t t\u01b0\u1eddng. Theo th\u00f3i quen \u0111\u1eb7t t\u00ean c\u1ee7a ng\u01b0\u1eddi Vi\u1ec7t, t\u00ean \"H\u1ed3ng\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con g\u00e1i v\u00ec \u0111\u00e2y c\u00f2n l\u00e0 t\u00ean m\u1ed9t lo\u1ea1i hoa xinh \u0111\u1eb9p lu\u00f4n ng\u1eddi s\u1eafc h\u01b0\u01a1ng. V\u00ec v\u1eady, t\u00ean \"H\u1ed3ng\" lu\u00f4n g\u1ee3i s\u1ef1 t\u01b0\u01a1i vui, xinh \u0111\u1eb9p, l\u00e0 h\u00ecnh \u1ea3nh gi\u00e0u s\u1ee9c s\u1ed1ng. \"H\u1ed3ng \u00dd\" mang \u00fd ngh\u0129a con l\u00e0 ni\u1ec1m mong \u01b0\u1edbc, l\u00e0 s\u1ef1 may m\u1eafn mang \u0111\u1ebfn cho ba m\u1eb9, hi v\u1ecdng cu\u1ed9c s\u1ed1ng mai sau c\u1ee7a con s\u1ebd lu\u00f4n g\u1eb7p \u0111\u01b0\u1ee3c nhi\u1ec1u \u0111i\u1ec1u t\u1ed1t l\u00e0nh, nh\u01b0 \u00fd.", "sex": 5}
{"first_name": "H\u01b0\u01a1ng \u00dd", "meaning": "\"H\u01b0\u01a1ng\" l\u00e0 m\u00f9i h\u01b0\u01a1ng, \"H\u01b0\u01a1ng\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 thanh tao d\u1ecbu d\u00e0ng. V\u1edbi t\u00ean \"H\u01b0\u01a1ng \u00dd\", ba m\u1eb9 mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi d\u1ecbu d\u00e0ng thanh tao nh\u01b0ng kh\u00f4ng k\u00e9m ph\u1ea7n m\u1ea1nh m\u1ebd, bi\u1ebft d\u00f9ng kh\u1ea3 n\u0103ng c\u1ee7a m\u00ecnh \u0111\u1ec3 chinh ph\u1ee5c nh\u1eefng th\u1eed th\u00e1ch trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
