{"first_name": "Kim \u00dd", "meaning": "\"Kim\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ti\u1ec1n, l\u00e0 v\u00e0ng. T\u00ean \"Kim\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c cha m\u1eb9 \u0111\u1eb7t v\u1edbi h\u00e0m \u00fd mong mu\u1ed1n cu\u1ed9c s\u1ed1ng sung t\u00fac, ph\u00fa qu\u00fd v\u1eefng b\u1ec1n, ki\u00ean c\u1ed1 d\u00e0nh cho con c\u00e1i. Ngo\u00e0i ra \"Kim\" c\u00f2n th\u1ec3 hi\u1ec7n s\u1ef1 qu\u00fd tr\u1ecdng, tr\u00e2n qu\u00fd c\u1ee7a m\u1ecdi ng\u01b0\u1eddi d\u00e0nh cho con. \"Kim \u00dd\" c\u00f3 ngh\u0129a l\u00e0 ni\u1ec1m tin, \u00fd ch\u00ed v\u00e0 mong \u01b0\u1edbc lu\u00f4n v\u1eefng b\u1ec1n, ki\u00ean c\u1ed1, l\u00e0 \u0111\u1ed9ng l\u1ef1c h\u01b0\u1edbng t\u1edbi cu\u1ed9c s\u1ed1ng sung t\u00fac.", "sex": 5}
{"first_name": "Li\u00ean \u00dd", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u00f3a hoa sen, th\u1ec3 i\u1ec7n s\u1ef1 thanh khi\u1ebft, thanh cao. \"Li\u00ean\" c\u00f2n l\u00e0 s\u1ef1 li\u00ean k\u1ebft li\u00ean h\u1ec7. T\u00ean \"Li\u00ean \u00dd\"  mang \u00fd ngh\u0129a li\u00ean t\u01b0\u1edfng con nh\u1ee9 \u0111\u00f3a hoa sen trong s\u00e1ng, thanh cao, lu\u00f4n s\u00e1ng ng\u1eddi ph\u1ea9m ch\u1ea5t cao qu\u00fd.", "sex": 5}
{"first_name": "Loan \u00dd", "meaning": "\"Loan\" \u0111\u1ec3 ch\u1ec9 lo\u00e0i chim Loan xinh \u0111\u1eb9p. \"Loan \u00dd\" con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p, nh\u00e2n c\u00e1ch thanh cao, ph\u1ea9m ch\u1ea5t v\u01b0\u01a1ng gi\u1ea3 v\u00e0 l\u00e0 ng\u01b0\u1eddi t\u00e0i n\u0103ng, \u0111\u1ee9c h\u1ea1nh, ph\u00fac h\u1eadu.", "sex": 5}
