{"first_name": "M\u1ed9c \u00dd", "meaning": "\"M\u1ed9c\"  l\u00e0 g\u1ed7, theo t\u00ednh c\u00e1ch th\u00ec \"M\u1ed9c\" l\u00e0 th\u1eadt th\u00e0 ch\u1ea5t ph\u00e1c. \"M\u1ed9c \u00dd\" mong  mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c, l\u00e0 ng\u01b0\u1eddi tr\u00ed tu\u1ec7 v\u00e0 bi\u1ebft t\u1ef1 l\u1eadp trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
