{"first_name": "Ph\u00fac \u00dd", "meaning": "Ch\u1eef  \"Ph\u00fac\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 ch\u1ec9 nh\u1eefng s\u1ef1 t\u1ed1t l\u00e0nh, gi\u00e0u sang, may m\u1eafn. T\u00ean \"Ph\u00fac\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 ph\u1ea9m ch\u1ea5t t\u1ed1t, lu\u00f4n g\u1eb7p may m\u1eafn, c\u00f3 nhi\u1ec1u c\u01a1 h\u1ed9i t\u1ed1t trong cu\u1ed9c s\u1ed1ng, th\u01b0\u1eddng \u0111\u01b0\u1ee3c qu\u00fd nh\u00e2n gi\u00fap \u0111\u1ee1, \u0111\u00e2y ch\u00ednh l\u00e0 mong mu\u1ed1n m\u00e0 b\u1ea5t c\u1ee9 cha m\u1eb9 n\u00e0o c\u0169ng mong \u01b0\u1edbc. \"Ph\u00fac \u00dd\" ngh\u0129a l\u00e0 nh\u1eefng \u0111i\u1ec1u mong mu\u1ed1n, nh\u1eefng \u01b0\u1edbc nguy\u1ec7n s\u1ebd tr\u1edf th\u00e0nh hi\u1ec7n th\u1ef1c v\u00ec con lu\u00f4n nh\u1eadn \u0111\u01b0\u1ee3c nh\u1eefng \u0111i\u1ec1u may m\u1eafn, t\u1ed1t l\u00e0nh.", "sex": 5}
