{"first_name": "T\u00e2m \u00dd", "meaning": "Ch\u1eef  \"T\u00e2m\" theo ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 tr\u00e1i tim, kh\u00f4ng ch\u1ec9 v\u1eady, \"T\u00e2m\" c\u00f2n l\u00e0 t\u00e2m h\u1ed3n, l\u00e0 t\u00ecnh c\u1ea3m, l\u00e0 tinh th\u1ea7n. T\u00ean \"T\u00e2m \u00dd\" th\u01b0\u1eddng th\u1ec3 hi\u1ec7n mong mu\u1ed1n b\u00ecnh y\u00ean, hi\u1ec1n h\u00f2a, lu\u00f4n h\u01b0\u1edbng thi\u1ec7n, c\u00f3 ph\u1ea9m ch\u1ea5t t\u1ed1t.", "sex": 5}
