{"first_name": "H\u1ea1nh Y\u00ean", "meaning": "Theo H\u00e1n - Vi\u1ec7t, t\u00ean \"H\u1ea1nh\" th\u1ee9 nh\u1ea5t, c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 ph\u00fac l\u1ed9c, l\u00e0 ph\u01b0\u1edbc l\u00e0nh, ngh\u0129a th\u1ee9 hai l\u00e0 n\u00f3i v\u1ec1 m\u1eb7t \u0111\u1ea1o \u0111\u1ee9c, t\u00ednh n\u1ebft c\u1ee7a con ng\u01b0\u1eddi. T\u00ean \"H\u1ea1nh Y\u00ean\" th\u01b0\u1eddng d\u00f9ng cho n\u1eef, ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i c\u00f3 t\u00ednh t\u00ecnh n\u1ebft na, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, \u0111\u00f4n h\u1eadu, ph\u1ea9m ch\u1ea5t cao \u0111\u1eb9p.", "sex": 5}
{"first_name": "H\u00f2a Y\u00ean", "meaning": "\"H\u00f2a\" c\u00f3 ngh\u0129a l\u00e0 \u00eam \u1ea5m, y\u00ean \u1ed5n ch\u1ec9 s\u1ef1 thu\u1eadn h\u1ee3p,th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 v\u1ec1 \u0111\u1ee9c t\u00ednh con ng\u01b0\u1eddi, hi\u1ec1n l\u00e0nh, th\u00e1i \u0111\u1ed9 t\u1eeb t\u1ed1n, m\u1ec1m m\u1ecfng. \"H\u00f2a Y\u00ean\" - con s\u1ebd l\u00e0 ng\u01b0\u1eddi h\u00ec\u00ean l\u00e0nh,ch\u00e2n th\u1eadt c\u00f3 nhi\u1ec1u \u0111\u1ee9c t\u00ednh t\u1ed1t, mong cho cu\u1ed9c s\u1ed1ng c\u1ee7a con \u00eam \u1ea5m y\u00ean \u1ed5n thu\u1eadn l\u1ee3i.", "sex": 5}
{"first_name": "Ho\u00e0i Y\u00ean", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Ho\u00e0i\" c\u00f3 ngh\u0129a l\u00e0 nh\u1edb, l\u00e0 mong ch\u1edd, tr\u00f4ng ng\u00f3ng. T\u00ean \"Ho\u00e0i\" trong tr\u01b0\u1eddng h\u1ee3p n\u00e0y th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t d\u1ef1a tr\u00ean t\u00e2m t\u01b0 t\u00ecnh c\u1ea3m c\u1ee7a b\u1ed1 m\u1eb9. Ngo\u00e0i ra \"Ho\u00e0i\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 t\u1ea5m l\u00f2ng, l\u00e0 t\u00e2m t\u00ednh, t\u00ecnh \u00fd b\u00ean trong con ng\u01b0\u1eddi. \u0110\u1eb7t t\u00ean \"Ho\u00e0i Y\u00ean\" ngh\u0129a l\u00e0 mong mu\u1ed1n con lu\u00f4n g\u1eb7p nh\u1eefng \u0111i\u1ec1u b\u00ecnh y\u00ean, an l\u00e0nh trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
{"first_name": "Ho\u00e0ng Y\u00ean", "meaning": "\"Ho\u00e0ng\" trong ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 m\u00e0u v\u00e0ng, \u00e1nh s\u1eafc c\u1ee7a v\u00e0ng v\u00e0 \u1edf m\u1ed9t ngh\u0129a kh\u00e1c th\u00ec \"Ho\u00e0ng\" th\u1ec3 hi\u1ec7n s\u1ef1 nghi\u00eam trang, r\u1ef1c r\u1ee1,huy ho\u00e0ng nh\u01b0 b\u1eadc vua ch\u00faa. T\u00ean \"Ho\u00e0ng Y\u00ean\" th\u1ec3 hi\u1ec7n c\u00f3 c\u1ed1t c\u00e1ch v\u01b0\u01a1ng gi\u1ea3, v\u1edbi mong mu\u1ed1n t\u01b0\u01a1ng lai ph\u00fa qu\u00fd, sang gi\u00e0u nh\u01b0ng v\u1eabn h\u01b0\u1edbng v\u1ec1 s\u1ef1 b\u00ecnh y\u00ean trong t\u00e2m h\u1ed3n.", "sex": 5}
{"first_name": "H\u1ed3ng Y\u00ean", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"H\u1ed3ng\" l\u00e0 \u00fd ch\u1ec9 m\u00e0u \u0111\u1ecf , m\u00e0 m\u00e0u \u0111\u1ecf v\u1ed1n th\u1ec3 hi\u1ec7n cho ni\u1ec1m vui, s\u1ef1 may m\u1eafn, c\u00e1t t\u01b0\u1eddng. Theo th\u00f3i quen \u0111\u1eb7t t\u00ean c\u1ee7a ng\u01b0\u1eddi Vi\u1ec7t, t\u00ean \"H\u1ed3ng Y\u00ean\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con g\u00e1i g\u1ee3i s\u1ef1 t\u01b0\u01a1i vui, xinh \u0111\u1eb9p, l\u00e0 h\u00ecnh \u1ea3nh gi\u00e0u s\u1ee9c s\u1ed1ng.", "sex": 5}
{"first_name": "H\u1eefu Y\u00ean", "meaning": "\"H\u1eefu\" l\u00e0 c\u00f3, l\u00e0 s\u1ee1 h\u1eefu. \"H\u1eefu Y\u00ean\", mong con l\u00e0 ng\u01b0\u1eddi c\u00f3 cu\u1ed9c s\u1ed1ng y\u00ean b\u00ecnh t\u1ed1t \u0111\u1eb9p trong t\u01b0\u01a1ng lai.", "sex": 5}
{"first_name": "Kh\u1ea3 Y\u00ean", "meaning": "\"Kh\u1ea3\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 t\u1eeb \u0111\u1ec3 ch\u1ec9 s\u1ef1 m\u1eebng vui, t\u00e1n th\u01b0\u1edfng. \"Kh\u1ea3 Y\u00ean\" l\u00e0 ni\u1ec1m vui c\u1ee7a ba m\u1eb9, mong con lu\u00f4n vui v\u1ebb, c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh d\u1ecb y\u00ean \u1ea3.", "sex": 5}
{"first_name": "Kh\u00e1nh Y\u00ean", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Kh\u00e1nh\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng s\u1ef1 vi\u1ec7c vui m\u1eebng, mang c\u1ea3m gi\u00e1c h\u00e2n hoan. T\u00ean \"Kh\u00e1nh Y\u00ean\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi \u0111\u1ee9c h\u1ea1nh, t\u1ed1t \u0111\u1eb9p mang l\u1ea1i c\u1ea3m gi\u00e1c vui t\u01b0\u01a1i, hoan h\u1ec9 cho nh\u1eefng ng\u01b0\u1eddi xung quanh.", "sex": 5}
{"first_name": "Khu\u00ea Y\u00ean", "meaning": "\"Khu\u00ea\" l\u00e0 n\u00e9t \u0111\u1eb9p thanh t\u00fa, s\u00e1ng trong nh\u01b0 v\u00ec sao, cu\u1ed1n h\u00fat nh\u01b0 ng\u1ecdc qu\u00fd. \"Khu\u00ea Y\u00ean\" l\u00e0 t\u00ean ba m\u1eb9 \u0111\u1eb7t v\u1edbi mong \u01b0\u1edbc con \u0111\u01b0\u1ee3c xinh \u0111\u1eb9p thanh t\u00fa, trong s\u00e1ng nh\u01b0 ng\u1ecdc, c\u00f3 \u0111\u1eddi s\u1ed1ng y\u00ean b\u00ecnh gi\u00e0u sang.", "sex": 5}
{"first_name": "Ki\u1ec1u Y\u00ean", "meaning": "Theo ti\u1ebfng H\u00e1n, t\u00ean \"Ki\u1ec1u\" mang \u00fd ngh\u0129a l\u00e0 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, c\u00f3 nhan s\u1eafc rung \u0111\u1ed9ng l\u00f2ng ng\u01b0\u1eddi n\u00ean th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con g\u00e1i v\u1edbi mong mu\u1ed1n c\u00e1c b\u00e9 g\u00e1i khi l\u1edbn l\u00ean s\u1ebd c\u00f3 \u0111\u01b0\u1ee3c dung m\u1ea1o xinh x\u1eafn, duy\u00ean d\u00e1ng v\u00e0 t\u1ea1o \u1ea5n t\u01b0\u1ee3ng v\u1edbi m\u1ecdi ng\u01b0\u1eddi. \"Ki\u1ec1u Y\u00ean\" - con l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh xinh \u0111\u1eb9p, t\u00e0i s\u1eafc v\u1eb9n to\u00e0n, cu\u1ed9c s\u1ed1ng c\u1ee7a con mong r\u1eb1ng s\u1ebd lu\u00f4n an nh\u00e0n gi\u1ea3n d\u1ecb.", "sex": 5}
{"first_name": "Kim Y\u00ean", "meaning": "\"Kim\" l\u00e0 v\u00e0ng. C\u00f2n c\u00f3 ngh\u0129a l\u00e0 ph\u00fa qu\u00fd. \"Kim Y\u00ean\" l\u00e0 t\u00ean ab m\u1eb9 \u0111\u1eb7t cho con v\u1edbi mong mu\u1ed1n t\u01b0\u01a1ng lai con gi\u00e0u  sang ph\u00fa qu\u00fd v\u00e0 b\u00ecnh y\u00ean trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
{"first_name": "Lam Y\u00ean", "meaning": "\"Lam\" l\u00e0 lo\u1ea1i ng\u1ecdc c\u00f3 m\u00e0u xanh,s\u1ebd mang l\u1ea1i may m\u1eafn, \u0111i\u1ec1m l\u00e0nh cho nh\u1eefng ng\u01b0\u1eddi th\u00e2n y\u00eau. \"Lam Y\u00ean\" con l\u00e0 vi\u00ean ng\u1ecdc mang l\u1ea1i ni\u1ec1m vui h\u1ea1nh ph\u00fac v\u00e0 b\u00ecnh y\u00ean cho ng\u01b0\u1eddi th\u00e2n trong gia \u0111\u00ecnh.", "sex": 5}
{"first_name": "L\u00e2m Y\u00ean", "meaning": "\"L\u00e2m\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi b\u00ecnh d\u1ecb, d\u1ec5 g\u1ea7n nh\u01b0 l\u1ebd t\u1ef1 nhi\u00ean nh\u01b0ng c\u0169ng m\u1ea1nh m\u1ebd v\u00e0 \u0111\u1ea7y uy l\u1ef1c. \"L\u00e2m Y\u00ean\" - con l\u00e0 ng\u01b0\u1eddi d\u1ec5 g\u1ea7n g\u0169i v\u00ec t\u00ednh gi\u1ea3n d\u1ecb n\u00ean \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng gi\u00fap \u0111\u1ee1, mong cho cu\u1ed9c s\u1ed1ng c\u1ee7a con s\u1ebd \u00eam \u1ea5m h\u1ea1nh ph\u00fac.", "sex": 5}
{"first_name": "Lan Y\u00ean", "meaning": "\"Lan\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa qu\u00fd, c\u00f3 h\u01b0\u01a1ng th\u01a1m, s\u1eafc \u0111\u1eb9p. \"Lan Y\u00ean\" - con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p t\u1ef1a hoa lan c\u00f3 h\u01b0\u01a1ng th\u01a1m ng\u00f2a ng\u1ea1t, cu\u1ed9c s\u1ed1ng c\u1ee7a con lu\u00f4n l\u00e0 1 m\u00e0u xanh t\u01b0\u01a1i \u0111\u1eb9p b\u00ecnh y\u00ean gi\u1ea3n d\u1ecb nh\u01b0 hoa Lan.", "sex": 5}
{"first_name": "Li\u1ec5u Y\u00ean", "meaning": "M\u1eb9 mong con s\u1ebd l\u00e0 m\u1ed9t c\u00f4 g\u00e1i d\u1ecbu d\u00e0ng, m\u1ec1m m\u1ea1i nh\u01b0 c\u00e0nh li\u1ec5u v\u00e0 cu\u1ed9c s\u1ed1ng c\u1ee7a con lu\u00f4n b\u1eb1ng ph\u1eb3ng, y\u00ean l\u00e0nh", "sex": 5}
{"first_name": "Mai Y\u00ean", "meaning": "\"Mai\" l\u00e0 hoa mai t\u01b0\u1ee3ng tr\u01b0ng cho m\u00f9a xu\u00e2n,c\u00f2n \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 v\u00f3c d\u00e1ng thanh t\u00fa, lu\u00f4n tr\u00e0n \u0111\u1ea7y s\u1ee9c s\u1ed1ng \u0111\u1ec3 b\u1eaft \u0111\u1ea7u m\u1ecdi vi\u1ec7c. \"Mai Y\u00ean\" con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p thanh t\u00fa, lu\u00f4n vui v\u1ebb nh\u01b0 m\u00f9a xu\u00e2n m\u1edbi, cu\u1ed9c s\u1ed1ng c\u1ee7a con tr\u00e0n ng\u1eadp ni\u1ec1m vui h\u1ea1nh ph\u00fac v\u00e0 y\u00ean b\u00ecnh.", "sex": 5}
{"first_name": "Minh Y\u00ean", "meaning": "\"Minh\" l\u00e0 th\u00f4ng minh lanh l\u1ee3i. \"Minh Y\u00ean\" - con l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh lu\u00f4n c\u00f3 cu\u1ed9c s\u1ed1ng y\u00ean b\u00ecnh h\u1ea1nh ph\u00fac.", "sex": 5}
