{"first_name": "M\u1ed9ng Y\u00ean", "meaning": "\"M\u1ed9ng\" c\u00f3 ngh\u0129a l\u00e0 gi\u1ea5c m\u01a1 \u00fd ch\u1ec9 s\u1ef1 huy\u1ec1n ho\u1eb7c \u0111\u1eb9p \u0111\u1ebd, \u0111i\u1ec1u m\u00e0 con ng\u01b0\u1eddi mong mu\u1ed1n. V\u1edbi t\u00ean \"M\u1ed9ng Y\u00ean\", ba m\u1eb9 mong con xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau nh\u01b0 b\u01b0\u1edbc ra t\u1eeb trong m\u1ed9ng v\u00e0 lu\u00f4n \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau m\u1ebfn.", "sex": 5}
