{"first_name": "Phong Y\u00ean", "meaning": "\"Phong\" l\u00e0 gi\u00f3, l\u00e0 s\u1ef1 m\u1ea1nh m\u1ebd d\u0169ng c\u1ea3m ki\u00ean tr\u00ec. \"Phong Y\u00ean\" - con l\u00e0 ng\u01b0\u1eddi m\u1ea1nh m\u1ebd nhi\u1ec1u ngh\u1ecb l\u1ef1c, bi\u1ebft c\u00e1ch v\u01b0\u1ee3t qua kh\u00f3 kh\u0103n th\u1eed th\u00e1ch trong cu\u1ed9c s\u1ed1ng, c\u00f3 nhi\u1ec1u ni\u1ec1m vui h\u1ea1nh ph\u00fac v\u00e0 b\u00ecnh y\u00ean.", "sex": 5}
