{"first_name": "Ph\u1ee5ng Y\u00ean", "meaning": "\"Ph\u1ee5ng\"  ch\u1ec9 ng\u01b0\u1eddi c\u00f3 di\u1ec7n m\u1ea1o ho\u00e0n m\u0129, duy\u00ean d\u00e1ng, ph\u1ea9m ch\u1ea5t \u0111\u1ee9c h\u1ea1nh, c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac v\u00e0 quy\u1ec1n qu\u00fd. \"Ph\u1ee5ng Y\u00ean\" l\u00e0 t\u00ean \u0111\u01b0\u1ee3c cha m\u1eb9 \u0111\u1eb7t v\u1edbi mong \u01b0\u1edbc con s\u1ebd duy\u00ean d\u00e1ng, xinh \u0111\u1eb9p, cao sang quy\u1ec1n qu\u00fd v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean an nh\u00e0n.", "sex": 5}
{"first_name": "Ph\u01b0\u01a1ng Y\u00ean", "meaning": "\"Ph\u01b0\u01a1ng\" l\u00e0 ph\u01b0\u01a1ng h\u01b0\u1edbng, c\u00f2n l\u00e0 ng\u01b0\u1eddi bi\u1ebft \u0111\u1ea1o l\u00fd. \"Ph\u01b0\u01a1ng Y\u00ean\" l\u00e0 t\u00ean ba m\u1eb9 \u0111\u1eb7t cho con, mong con l\u00e0 ng\u01b0\u1eddi c\u00f3 t\u00ecnh ngh\u0129a, bi\u1ebft c\u00e1ch c\u01b0 x\u1eed v\u1edbi m\u1ecdi ng\u01b0\u1eddi, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau m\u1ebfn v\u00e0 b\u00ecnh an trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
{"first_name": "Qu\u1ebf Y\u00ean", "meaning": "\"Qu\u1ebf\" l\u00e0 lo\u1ea1i th\u1ea3o m\u1ed9c d\u00f9ng l\u00e0m thu\u1ed1c, c\u00f3 h\u01b0\u01a1ng th\u01a1m. \"Qu\u1ebf Y\u00ean\" - con l\u00e0 ng\u01b0\u1eddi mang l\u1ea1i nhi\u1ec1u \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p trong cu\u1ed9c s\u1ed1ng v\u00e0 l\u00e0m \u0111\u01b0\u1ee3c nhi\u1ec1u vi\u1ec7c gi\u00fap \u00edch cho \u0111\u1eddi, cu\u1ed9c s\u1ed1ng c\u1ee7a con lu\u00f4n b\u00ecnh y\u00ean v\u00e0 vui v\u1ebb h\u1ea1nh ph\u00fac", "sex": 5}
{"first_name": "Qu\u1ef3nh Y\u00ean", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"Qu\u1ef3nh\" l\u00e0 m\u1ed9t vi\u00ean ng\u1ecdc \u0111\u1eb9p v\u00e0 thanh t\u00fa. Ngo\u00e0i ra \"Qu\u1ef3nh\" c\u00f2n l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa lu\u00f4n n\u1edf ng\u00e1t h\u01b0\u01a1ng v\u00e0o ban \u0111\u00eam. T\u00ean \"Qu\u1ef3nh Y\u00ean\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi thanh t\u00fa, dung m\u1ea1o xinh \u0111\u1eb9p, b\u1ea3n t\u00ednh khi\u00eam nh\u01b0\u1eddng, thanh cao.", "sex": 5}
{"first_name": "T\u00e2m Y\u00ean", "meaning": "\"T\u00e2m\" l\u00e0 tr\u00e1i tim, t\u00e2m h\u1ed3n. \"T\u00e2m Y\u00ean\" - con l\u00e0 ng\u01b0\u1eddi c\u00f3 tr\u00e1i tim nh\u00e2n \u00e1i hi\u1ec1n h\u00f2a, l\u00e0 ng\u01b0\u1eddi lu\u00f4n s\u1ed1ng v\u00ec ng\u01b0\u1eddi kh\u00e1c v\u00e0 \u0111\u1eddi s\u1ed1ng c\u1ee7a con an nh\u00e0 b\u00ecnh y\u00ean h\u1ea1nh ph\u00fac", "sex": 5}
{"first_name": "Th\u1ea1ch Y\u00ean", "meaning": "\"Th\u1ea1ch\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u00e1, n\u00f3i \u0111\u1ebfn nh\u1eefng c\u00f3 t\u00ednh ch\u1ea5t ki\u00ean c\u1ed1, c\u1ee9ng c\u00e1p. T\u1ef1a nh\u01b0 \u0111\u00e1, \"Th\u1ea1ch\" th\u01b0\u1eddng th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1ecfe m\u1ea1nh, \u00fd ch\u00ed ki\u00ean c\u01b0\u1eddng. \"Th\u1ea1ch Y\u00ean\" - con l\u00e0 ng\u01b0\u1eddi m\u1ea1nh m\u1ebd c\u00f3 th\u1ec3 ch\u1ea5t kh\u1ecfe suy ngh\u0129 c\u1ee7a con ch\u00ednh ch\u1eafn \u00edt b\u1ecb giao \u0111\u1ed9ng v\u00e0 ng\u01b0\u1eddi c\u00f3 ch\u00ed h\u01b0\u1edbng v\u00e0 quy\u1ebft t\u00e2m l\u1edbn.", "sex": 5}
{"first_name": "B\u1ea1ch Y\u1ebfn", "meaning": "B\u1ea1ch l\u00e0 m\u00e0u tr\u1eafng, c\u00f4ng minh, r\u00f5 r\u00e0ng.B\u1ea1ch Y\u1ebfn l\u00e0 ng\u01b0\u1eddi trong tr\u1eafng, s\u1ed1ng minh b\u1ea1ch, th\u1eb3ng th\u1eafn, kh\u00f4ng l\u00e0m h\u1ea1i ng\u01b0\u1eddi kh\u00e1c.", "sex": 5}
{"first_name": "B\u0103ng Y\u1ebfn", "meaning": "B\u0103ng ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, l\u00e0n da tr\u1eafng n\u00f5n, ng\u01b0\u1eddi c\u00f3 ph\u1ea9m h\u1ea1nh, kh\u00ed ti\u1ebft thanh cao, t\u1ea5m l\u00f2ng trong s\u00e1ng kh\u00f3 lay \u0111\u1ed9ng. B\u0103ng y\u1ebfn mong mu\u1ed1n con xinh \u0111\u1eb9p thanh khi\u1ebft nh\u01b0 nh\u01b0ng t\u1ea3ng b\u0103ng tr\u1eafng ng\u1ea7n v\u00e0 vui v\u1ebb ho\u1ea1t b\u00e1t trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
{"first_name": "B\u1ea3o Y\u1ebfn", "meaning": "ch\u00fa chim y\u1ebfn qu\u00fd gi\u00e1", "sex": 5}
{"first_name": "B\u00edch Y\u1ebfn", "meaning": "Ch\u1eef \"B\u00edch\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t lo\u00e0i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng. V\u00ec v\u1eady t\u00ean \"B\u00edch\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 con ng\u01b0\u1eddi v\u1edbi mong mu\u1ed1n m\u1ed9t dung m\u1ea1o xinh \u0111\u1eb9p, s\u00e1ng ng\u1eddi, m\u1ed9t ph\u1ea9m ch\u1ea5t cao qu\u00fd, thanh tao, l\u00e0 ng\u01b0\u1eddi t\u00e0i c\u00e0ng m\u00e0i d\u0169a c\u00e0ng r\u00e8n luy\u1ec7n s\u1ebd c\u00e0ng t\u1ecfa s\u00e1ng. \"B\u00edch Y\u1ebfn\" ngh\u0129a l\u00e0 con chim y\u1ebfn xinh \u0111\u1eb9p, thanh tao, s\u00e1ng ng\u1eddi.", "sex": 5}
{"first_name": "C\u1ea9m Y\u1ebfn", "meaning": "\"C\u1ea9m\" l\u00e0 lo\u1ea1i g\u1ed7 qu\u00fd, th\u01b0\u1eddng \u00e1m ch\u1ec9 s\u1ef1 quy\u1ec1n qu\u00fd, gi\u00e0u sang. \"C\u1ea9m Y\u1ebfn\" c\u00f3 ngh\u0129a l\u00e0 con chim y\u1ebfn xinh \u0111\u1eb9p, qu\u00fd b\u00e1u, gi\u00e0u sang", "sex": 5}
{"first_name": "Ch\u00e2u Y\u1ebfn", "meaning": "\"Ch\u00e2u\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 ng\u1ecdc trai, hay c\u00f2n g\u1ecdi l\u00e0 tr\u00e2n ch\u00e2u - v\u1edbi v\u1ebb \u0111\u1eb9p tinh khi\u1ebft v\u00e0 r\u1ef1c s\u00e1ng c\u1ee7a m\u00ecnh, ng\u1ecdc trai mu\u00f4n \u0111\u1eddi v\u1eabn \u0111\u01b0\u1ee3c ng\u1ee3i ca nh\u01b0 m\u1ed9t b\u1ea3o v\u1eadt tuy\u1ec7t \u0111\u1eb9p m\u00e0 \u0111\u1ea1i d\u01b0\u01a1ng bao la \u0111\u00e3 ban t\u1eb7ng cho con ng\u01b0\u1eddi. V\u00ec v\u1eady, \u0111\u1eb7t t\u00ean n\u00e0y cho con v\u1edbi \u00fd ngh\u0129a l\u00e0 v\u1eadt th\u1ec3 v\u00f4 c\u00f9ng qu\u00ed gi\u00e1 c\u1ee7a bi\u1ec3n c\u1ea3. \"Ch\u00e2u Y\u1ebfn\" ngh\u0129a l\u00e0 c\u00f4 g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, th\u00f4ng minh lanh l\u1ee3i, l\u00e0 con chim y\u1ebfn qu\u00fd b\u00e1u c\u1ee7a gia \u0111\u00ecnh.", "sex": 5}
{"first_name": "Chi Y\u1ebfn", "meaning": "Chi ch\u1ec9 s\u1ef1 cao sang qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. Chi y\u1ebfn mong mu\u1ed1n con lu\u00f4n vui t\u01b0\u01a1i h\u1ea1nh ph\u00fac v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac gi\u00e0u sang ph\u00fa qu\u00fd.", "sex": 5}
{"first_name": "Di\u1ec5m Y\u1ebfn", "meaning": "Di\u1ec5m l\u00e0 \u0111\u1eb9p m\u1ed9t c\u00e1ch r\u1ef1c r\u1ee1, l\u1ed9ng l\u1eaby.Di\u1ec5m Y\u1ebfn l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p, sang tr\u1ecdng v\u00e0 y\u00eau ki\u1ec1u, c\u00f3 cu\u1ed9c s\u1ed1ng t\u1ed1t \u0111\u1eb9p do may m\u1eafn.", "sex": 5}
{"first_name": "Di\u1ec7p Y\u1ebfn", "meaning": "Di\u1ec7p l\u00e0 m\u00e0u xanh nh\u1eb9, c\u00f3 t\u00ednh ch\u1ea5t lo\u00e3ng.Di\u1ec7p Y\u1ebfn l\u00e0 ng\u01b0\u1eddi lu\u00f4n c\u00f3 ni\u1ec1m hy v\u1ecdng m\u00e3nh li\u1ec7t v\u00e0 h\u01b0\u1edbng \u0111\u1ebfn thi\u00ean nhi\u00ean.", "sex": 5}
{"first_name": "Di\u1ec7u Y\u1ebfn", "meaning": "\"Di\u1ec7u\" theo ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 \u0111\u1eb9p, l\u00e0 tuy\u1ec7t di\u1ec7u, \u00fd ch\u1ec9 nh\u1eefng \u0111i\u1ec1u tuy\u1ec7t v\u1eddi \u0111\u01b0\u1ee3c t\u1ea1o n\u00ean b\u1edfi s\u1ef1 kh\u00e9o l\u00e9o, k\u00ec di\u1ec7u. T\u00ean \"Di\u1ec7u\" mang l\u1ea1i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0ng v\u1eabn cu\u1ed1n h\u00fat, \u1ea5n t\u01b0\u1ee3ng n\u00ean th\u01b0\u1eddng ph\u00f9 h\u1ee3p \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i. \"Di\u1ec7u Y\u1ebfn\" l\u00e0 con chim y\u1ebfn xinh \u0111\u1eb9p, nh\u1eb9 nh\u00e0ng, thu h\u00fat.", "sex": 5}
{"first_name": "Du Y\u1ebfn", "meaning": "Du l\u00e0 ng\u01b0\u1eddi c\u00f3 cu\u1ed9c s\u1ed1ng s\u00f4i n\u1ed5i, th\u00edch \u0111i \u0111\u00e2y \u0111\u00f3. Du Y\u1ebfn con l\u00e0 ng\u01b0\u1eddi n\u0103ng \u0111\u1ed9ng s\u00f4i n\u1ed5i, cu\u1ed9c s\u1ed1ng lu\u00f4n vui t\u01b0\u01a1i v\u00e0 h\u1ea1nh ph\u00fac", "sex": 5}
{"first_name": "Duy Y\u1ebfn", "meaning": "Duy trong ti\u1ebfng h\u00e1n vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u01b0 duy, suy ngh\u0129 th\u1ea5u \u0111\u00e1o. Duy Y\u1ebfn con l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh c\u00f3 t\u01b0 duy t\u1ed1t v\u00e0 l\u00e0 ng\u01b0\u1eddi lu\u00f4n s\u1ed1ng l\u1ea1c quan y\u00eau \u0111\u1eddi.", "sex": 5}
{"first_name": "Duy\u00ean Y\u1ebfn", "meaning": "Duy\u00ean c\u00f3 ngh\u0129a l\u00e0 t\u1ebf nh\u1ecb duy\u00ean d\u00e1ng h\u1ea5p d\u1eabn. Duy\u00ean Y\u1ebfn mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p duy\u00ean d\u00e1ng, bi\u1ebft t\u1ea1o ni\u1ec1m vui cho m\u1ecdi ng\u01b0\u1eddi v\u00e0 \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng. Cu\u1ed9c s\u1ed1ng con h\u1ea1nh ph\u00fac v\u00e0 b\u00ecnh y\u00ean vui v\u1ebb.", "sex": 5}
{"first_name": "Gia Y\u1ebfn", "meaning": "\"Gia\" trong ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f2n l\u00e0 gia \u0111\u00ecnh, l\u00e0 m\u00e1i nh\u00e0 n\u01a1i m\u1ecdi ng\u01b0\u1eddi sum v\u1ea7y, sinh ho\u1ea1t b\u00ean nhau. Ngo\u00e0i ra ch\u1eef \"Gia\" c\u00f2n c\u00f3 ngh\u0129 l\u00e0 xinh \u0111\u1eb9p, \u01b0u t\u00fa, mang ph\u1ea9m ch\u1ea5t cao qu\u00fd . \"Gia Y\u1ebfn\" l\u00e0 con chim y\u1ebfn b\u00e9 nh\u1ecf, xinh \u0111\u1eb9p, \u01b0u t\u00fa c\u1ee7a gia \u0111\u00ecnh.", "sex": 5}
{"first_name": "H\u00e0 Y\u1ebfn", "meaning": "H\u00e0 l\u00e0 con s\u00f4ng. H\u00e0 Y\u1ebfn mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p gi\u1ecfi giang c\u00f3 \u00fd ch\u00ed ho\u00e0i b\u00e3o l\u1edbn nh\u01b0 con s\u00f4ng, lu\u00f4n m\u00e3nh li\u1ec7t v\u00e0 kh\u00f4ng ng\u1eebng ph\u1ea5n \u0111\u1ea5u.", "sex": 5}
{"first_name": "H\u1ea1 Y\u1ebfn", "meaning": "H\u1ea1 l\u00e0 m\u00f9a h\u00e8, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 an nh\u00e0n , r\u1ea3nh r\u1ed7i. H\u1ea1 Y\u1ebfn l\u00e0 ng\u01b0\u1eddi v\u00f4 t\u01b0, y\u00eau \u0111\u1eddi, c\u00f3 cu\u1ed9c s\u1ed1ng sung s\u01b0\u1edbng.", "sex": 5}
