{"first_name": "Ph\u01b0\u01a1ng Li\u00ean", "meaning": "Ph\u01b0\u01a1ng Li\u00ean c\u00f3 ngh\u0129a l\u00e0 \"b\u00f4ng sen th\u01a1m\". V\u1edbi h\u00ecnh \u1ea3nh thanh tho\u00e1t c\u1ee7a hoa sen c\u00f9ng t\u1eeb Ph\u01b0\u01a1ng \u00fd ch\u1ec9 h\u01b0\u01a1ng th\u01a1m nh\u1eb9 nh\u00e0ng t\u1ea1o cho c\u00e1i t\u00ean s\u1ef1 m\u1ec1m m\u1ea1i, thanh tao ph\u00f9 h\u1ee3p cho ng\u01b0\u1eddi con g\u00e1i. V\u1edbi t\u00ean n\u00e0y cha m\u1eb9 mong con s\u1ebd l\u00e0 b\u00f4ng hoa sen thanh khi\u1ebft, bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a s\u1ef1 thanh cao, trong s\u00e1ng, s\u1ed1ng hi\u1ec1n h\u00f2a, t\u1ecfa h\u01b0\u01a1ng th\u01a1m v\u1edbi t\u1ea5m l\u00f2ng bao dung.", "sex": 5}
