{"first_name": "Th\u1ea1ch Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen Th\u1ea1ch l\u00e0 \u0111\u00e1. Th\u1ea1ch Li\u00ean l\u00e0 hoa sen \u0111\u00e1 bi\u1ec3u t\u01b0\u1ee3ng t\u1ea5m l\u00f2ng son s\u1eaft trong t\u00ecnh b\u1ea1n v\u00e0 t\u00ecnh y\u00eau. Mang \u00fd ngh\u0129a con s\u1ebd c\u00f3 t\u1ea5m l\u00f2ng bi\u1ebft y\u00eau th\u01b0\u01a1ng & chung th\u1ee7y", "sex": 5}
{"first_name": "Thanh Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen. Thanh l\u00e0 thanh khi\u1ebft, trong s\u00e1ng. Thanh Li\u00ean c\u00f3 ngh\u0129a l\u00e0 con xinh \u0111\u1eb9p, trong s\u00e1ng, thu\u1ea7n khi\u1ebft, kh\u00f4ng g\u1ee3n ch\u00fat pha t\u1ea1p n\u00e0o nh\u01b0 hoa sen thanh tao.", "sex": 5}
{"first_name": "Th\u00fay Li\u00ean", "meaning": "\"Th\u00fay Li\u00ean - m\u1ed9t c\u00e1i t\u00ean \u0111\u1eb9p \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i. Trong ti\u1ebfng H\u00e1n Vi\u1ec7t Th\u00fay c\u00f3 ngh\u0129a l\u00e0 vi\u00ean ng\u1ecdc, ng\u1ecdc; li\u00ean l\u00e0 b\u00f4ng hoa sen.\r\nT\u00ean Th\u00fay Li\u00ean mang \u00fd ngh\u0129a l\u00e0 con s\u1ebd xinh \u0111\u1eb9p v\u00e0 cao qu\u00fd nh\u01b0 b\u00f4ng sen b\u1eb1ng ng\u1ecdc.\"", "sex": 5}
{"first_name": "Th\u1ee5y Li\u00ean", "meaning": "Trong ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen, lo\u00e0i hoa t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 thanh khi\u1ebft, trong s\u1ea1ch, d\u00f9 m\u1ecdc l\u00ean t\u1eeb b\u00f9n nh\u01a1 nh\u01b0ng kh\u00f4ng h\u1ec1 h\u00f4i tanh, v\u1eabn khoe s\u1eafc, ng\u00e1t h\u01b0\u01a1ng, \u0111\u1eb9p d\u1ecbu d\u00e0ng. \"Th\u1ee5y\" l\u00e0 t\u00ean chung c\u1ee7a ng\u1ecdc khu\u00ea ng\u1ecdc b\u00edch, \u0111\u1eddi x\u01b0a d\u00f9ng ng\u1ecdc \u0111\u1ec3 l\u00e0m tin. T\u00ean \"Th\u1ee5y\" th\u1ec3 hi\u1ec7n \u0111\u01b0\u1ee3c s\u1ef1 thanh cao, qu\u00fd ph\u00e1i. C\u1ea3 \"Li\u00ean\" v\u00e0 \"Th\u1ee5y\" \u0111\u1ec1u to\u00e1t l\u00ean s\u1ef1 thanh cao, qu\u00fd ph\u00e1i. \u0110\u1eb7t con t\u00ean \" Th\u1ee5y Li\u00ean\" v\u1edbi mong mu\u1ed1n con s\u1ebd xinh \u0111\u1eb9p, sang tr\u1ecdng, cu\u1ed9c s\u1ed1ng sung t\u00fac, vinh hoa, c\u00f3 t\u00e2m t\u00ednh thanh t\u1ecbnh, s\u1ed1ng ngay th\u1eb3ng, kh\u00f4ng v\u1eabn \u0111\u1ee5c b\u1edfi nh\u1eefng phi\u1ec1n n\u00e3o c\u1ee7a s\u1ef1 \u0111\u1eddi, ph\u1ea9m ch\u1ea5t thanh cao, bi\u1ebft ki\u00ean nh\u1eabn ch\u1ecbu th\u01b0\u01a1ng ch\u1ecbu kh\u00f3, m\u1ea1nh m\u1ebd sinh t\u1ed3n \u0111\u1ec3 v\u01b0\u01a1n vai gi\u1eefa \u0111\u1ea5t tr\u1eddi v\u1edbi t\u1ea5m l\u00f2ng b\u00e1c \u00e1i, bao dung.", "sex": 5}
{"first_name": "Xu\u00e2n Li\u00ean", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen. Xu\u00e2n l\u00e0 t\u01b0\u1ee3ng tr\u01b0ng cho tu\u1ed5i tr\u1ebb, t\u01b0\u01a1i \u0111\u1eb9p, tr\u00e0n \u0111\u1ea7y s\u1ee9c s\u1ed1ng. Xu\u00e2n Li\u00ean c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p nh\u01b0 hoa sen trong m\u00f9a xu\u00e2n, tr\u00e0n s\u1ee9c s\u1ed1ng", "sex": 5}
