{"first_name": "B\u1ea3o Nguy\u00ean", "meaning": "Nguy\u00ean\" c\u00f3 ngh\u0129a l\u00e0 tinh kh\u00f4i, \u0111\u1eb9p \u0111\u1ebd, g\u1ee3i l\u00ean \u00fd ngh\u0129a d\u1eabn \u0111\u1ea7u, s\u00e1ng s\u1ee7a, v\u1eefng v\u00e0ng, \u0111i\u1ec1m \u0111\u1ea1m. B\u00ean c\u1ea1nh, t\u00ean \"B\u1ea3o\" c\u00f2n \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 cu\u1ed9c s\u1ed1ng \u1ea5m \u00eam lu\u00f4n \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng. \u0110\u1eb7t t\u00ean cho con l\u00e0 \"Nguy\u00ean B\u1ea3o\", b\u1ed1 m\u1eb9 ng\u1ea7m g\u1eedi g\u1eafm th\u00f4ng \u0111i\u1ec7p r\u1eb1ng con ch\u00ednh l\u00e0 b\u1ea3o v\u1eadt m\u00e0 b\u1ed1 m\u1eb9 lu\u00f4n tr\u00e2n qu\u00fd h\u00e0ng \u0111\u1ea7u", "sex": 3}
