{"first_name": "B\u00ecnh Nguy\u00ean", "meaning": "\"B\u00ecnh\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 c\u00f4ng b\u1eb1ng, ngang nhau kh\u00f4ng thi\u00ean l\u1ec7ch, c\u00f4ng ch\u00ednh. V\u00ec v\u1eady, t\u00ean \"B\u00ecnh\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 c\u1ed1t c\u00e1ch, bi\u1ebft ph\u00e2n \u0111\u1ecbnh r\u1ea1ch r\u00f2i, t\u00ednh kh\u00ed \u00f4n h\u00f2a, bi\u1ebft \u0111i\u1ec1u ph\u1ed1i c\u00f4ng vi\u1ec7c, th\u00e1i \u0111\u1ed9 tr\u01b0\u1edbc cu\u1ed9c s\u1ed1ng lu\u00f4n b\u00ecnh t\u0129nh an \u0111\u1ecbnh. Ngo\u00e0i ra, \"B\u00ecnh\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 \u00eam th\u1ea5m, c\u1ea3m gi\u00e1c th\u01b0 th\u00e1i hay ch\u1ec9 v\u1ec1 h\u00f2a kh\u00ed, v\u1eadn h\u1ea1n.", "sex": 3}
