{"first_name": "Trinh Ng\u1ecdc", "meaning": "\"Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh. \"Trinh\" l\u00e0 ti\u1ebft h\u1ea1nh, trong s\u00e1ng, th\u1ee7y chung. T\u00ean \"Trinh\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u1ecfa s\u00e1ng nh\u01b0 ng\u1ecdc qu\u00fd, t\u00e2m h\u1ed3n trong s\u00e1ng, thu\u1ea7n khi\u1ebft v\u00e0 c\u00f3 \u0111\u1ee9c h\u1ea1nh", "sex": 5}
{"first_name": "Truy\u1ec1n Ng\u1ecdc", "meaning": "\"Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh,... th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed. T\u00ean Truy\u1ec1n Ng\u1ecdc  l\u00e0 mong mu\u1ed1n con c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u1ecfa s\u00e1ng nh\u01b0 h\u00f2n ng\u1ecdc qu\u00fd, cu\u1ed9c s\u1ed1ng gi\u00e0u sang, ph\u00fa qu\u00fd", "sex": 5}
