{"first_name": "Tuy\u1ec1n Ng\u1ecdc", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ng\u1ecdc Tuy\u1ec1n\" c\u00f3 ngh\u0129a l\u00e0 su\u1ed1i ng\u1ecdc. T\u00ean \"Tuy\u1ec1n Ng\u1ecdc \" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, tinh th\u1ea7n th\u01b0 th\u00e1i, thanh cao, t\u00e2m trong s\u00e1ng nh\u01b0 d\u00f2ng su\u1ed1i ng\u1ecdc. \" Tuy\u1ec1n Ng\u1ecdc\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c ba m\u1eb9 g\u1eedi g\u1eafm r\u1ea5t nhi\u1ec1u th\u00f4ng \u0111i\u1ec7p mong con g\u00e1i c\u00f3 \u0111\u1ee7 m\u1ecdi t\u1ed1 ch\u1ea5t \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t ng\u01b0\u1eddi con g\u00e1i \u0111\u00e1ng y\u00eau, \u0111\u1ee9c h\u1ea1nh", "sex": 5}
{"first_name": "Tuy\u1ebft Ng\u1ecdc", "meaning": "\"Tuy\u1ebft Ng\u1ecdc c\u00f3 th\u1ec3 hi\u1ec3u l\u00e0 \"\"tuy\u1ebft \u0111\u1eb9p v\u00e0 tr\u1eafng trong nh\u01b0 ng\u1ecdc\"\". C\u00e1i t\u00ean Tuy\u1ebft Ng\u1ecdc g\u1ee3i l\u00ean v\u1ebb \u0111\u1eb9p trong s\u00e1ng, thu\u1ea7n khi\u1ebft v\u00e0 tinh kh\u00f4i...\r\nTuy\u1ebft l\u00e0 tinh th\u1ec3 b\u0103ng nh\u1ecf v\u00e0 tr\u1eafng k\u1ebft th\u00e0nh kh\u1ed1i x\u1ed1p, nh\u1eb9, r\u01a1i \u1edf v\u00f9ng c\u00f3 kh\u00ed h\u1eadu l\u1ea1nh. Ng\u1ecdc l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh,... th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed.\"", "sex": 5}
{"first_name": "V\u00e2n Ng\u1ecdc", "meaning": "T\u00ean Ng\u1ecdc th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u1ecfa s\u00e1ng nh\u01b0 h\u00f2n ng\u1ecdc qu\u00fd, trong tr\u1eafng, thu\u1ea7n khi\u1ebft. V\u00e2n l\u00e0 1 t\u1eeb nh\u1eb9 nh\u00e0ng, \u00fd ngh\u0129a hoa m\u1ef9 \u0111\u1ec3 \u0111\u1eb7t cho ng\u01b0\u1eddi con g\u00e1i. V\u00e2n Ng\u1ecdc mang \u00fd ngh\u0129a con l\u00e0 c\u00f4 g\u00e1i xinh \u0111\u1eb9p, nh\u1eb9 nh\u00e0ng.", "sex": 5}
{"first_name": "V\u0129nh Ng\u1ecdc", "meaning": "T\u00ean Ng\u1ecdc th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u1ecfa s\u00e1ng nh\u01b0 h\u00f2n ng\u1ecdc qu\u00fd, trong tr\u1eafng, thu\u1ea7n khi\u1ebft. V\u0129nh Ng\u1ecdc ngh\u0129a l\u00e0 con xinh \u0111\u1eb9p, may m\u1eafn & gi\u00e0u c\u00f3 mu\u00f4n \u0111\u1eddi.", "sex": 7}
{"first_name": "Xu\u00e2n Ng\u1ecdc", "meaning": "T\u00ean Ng\u1ecdc th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u1ecfa s\u00e1ng nh\u01b0 h\u00f2n ng\u1ecdc qu\u00fd, trong tr\u1eafng, thu\u1ea7n khi\u1ebft. Xu\u00e2n Ng\u1ecdc ngh\u0129a l\u00e0 con xinh x\u1eafn nh\u01b0 vi\u00ean ng\u1ecdc c\u1ee7a m\u00f9a xu\u00e2n.", "sex": 5}
{"first_name": "Y\u1ebfn Ng\u1ecdc", "meaning": "T\u00ean Ng\u1ecdc th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u1ecfa s\u00e1ng nh\u01b0 h\u00f2n ng\u1ecdc qu\u00fd, trong tr\u1eafng, thu\u1ea7n khi\u1ebft. Y\u1ebfn l\u00e0 t\u00ean 1 lo\u00e0i chim c\u00f3 ti\u1ebfng h\u00f3t hay. Y\u1ebfn Ng\u1ecdc mang \u00fd ngh\u0129a con xinh \u0111\u1eb9p nh\u01b0 ng\u1ecdc & nhanh nh\u1eb9n, gi\u1ecdng n\u00f3i th\u00e1nh th\u00f3t nh\u01b0 chim.", "sex": 5}
{"first_name": "\u00c1i Quy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\u00c1i\" c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a, \"Quy\u00ean\" l\u00e0 t\u00ean g\u1ecdi c\u1ee7a m\u1ed9t lo\u00e0i chim \u0111\u1eb9p, c\u00f3 ti\u1ebfng h\u00f3t hay, th\u01b0\u1eddng xu\u1ea5t hi\u1ec7n v\u00e0o m\u00f9a h\u00e8. T\u00ean \"\u00c1i Quy\u00ean\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, \u0111oan trang, hi\u1ec1n l\u00e0nh, c\u00f3 t\u00e0i n\u0103ng.", "sex": 5}
