{"first_name": "B\u00edch Quy\u00ean", "meaning": "Ch\u1eef \"B\u00edch\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t loa\u0323i \u0111a\u0301 quy\u0301 c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng, \"Quy\u00ean\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn m\u1ed9t lo\u00e0i chim th\u01b0\u1eddng xu\u1ea5t hi\u1ec7n v\u00e0o m\u00f9a h\u00e8, c\u00f3 ti\u1ebfng h\u00f3t l\u1ea3nh l\u00f3t, l\u00e0m xao \u0111\u1ed9ng l\u00f2ng ng\u01b0\u1eddi. T\u00ean \"B\u00edch Quy\u00ean\" \u00fd ch\u1ec9 c\u00f4 g\u00e1i \u0111\u1eb9p, diu d\u00e0ng v\u00e0 n\u1ebft na, \u0111\u1eb1m th\u1eafm v\u00e0 c\u00f3 hi\u1ec3u bi\u1ebft, bi\u1ebft ph\u00e1t huy t\u00e0i n\u0103ng c\u1ee7a m\u00ecnh", "sex": 5}
{"first_name": "Giang Quy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Giang\"c\u00f3 ngh\u0129a l\u00e0 \u0111\u1eb9p, l\u00e0 tuy\u1ec7t di\u1ec7u, \u00fd ch\u1ec9 nh\u1eefng \u0111i\u1ec1u tuy\u1ec7t v\u1eddi \u0111\u01b0\u1ee3c t\u1ea1o n\u00ean b\u1edfi s\u1ef1 kh\u00e9o l\u00e9o, k\u00ec di\u1ec7u. Giang l\u00e0 d\u00f2ng s\u00f4ng l\u1edbn. \u00fd Ch\u00fac con l\u00e0 m\u1ed9t \u0111\u1ee9a tr\u1ebb kh\u1ecfe m\u1ea1nh th\u00e0nh c\u00f4ng.", "sex": 7}
{"first_name": "H\u00e0 Quy\u00ean", "meaning": "Quy\u00ean H\u00e0 th\u01b0\u1eddng l\u00e0 nh\u1eefng ng\u01b0\u1eddi c\u00f3 c\u00e1 t\u00ednh m\u1ea1nh m\u1ebd, th\u00edch v\u01b0\u1ee3t qua nh\u1eefng gian nan kh\u00f3 kh\u0103n nh\u1edd tr\u00ed tu\u1ec7 v\u00e0 t\u00e0i n\u0103ng m\u00e0 l\u00e0m n\u00ean vi\u1ec7c l\u1edbn.", "sex": 5}
