{"first_name": "Kh\u00e1nh Quy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Kh\u00e1nh\" c\u00f3 ngh\u0129a l\u00e0 ti\u1ebfng chu\u00f4ng, \"Quy\u00ean\" c\u00f3 ngh\u0129a l\u00e0 con su\u1ed1i nh\u1ecf. \"Kh\u00e1nh Quy\u00ean\" l\u00e0 con su\u1ed1i nh\u1ecf c\u00f3 \u00e2m thanh trong v\u1eaft v\u00e0 cao vang nh\u01b0 ti\u1ebfng chu\u00f4ng. T\u00ean \"Kh\u00e1nh Quy\u00ean\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi c\u00f3 v\u00f3c d\u00e1ng thanh t\u00fa, trong s\u00e1ng, ti\u1ebfng n\u00f3i thanh vang, nh\u1eb9 nh\u00e0ng, d\u1ecbu d\u00e0ng, \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi y\u00eau m\u1ebfn.", "sex": 5}
