{"first_name": "Nam Quy\u00ean", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Quy\u00ean ngo\u00e0i mong mu\u1ed1n con s\u1ebd xinh \u0111\u1eb9p, quy\u1ec1n qu\u00fd, \u0111\u1eb1m th\u1eafm n\u1ebft na, c\u00f2n mong con s\u1ed1ng c\u00f3 \u0111\u1ea1o l\u00fd, hi\u1ec3u ph\u1ea3i tr\u00e1i, \u0111\u00fang sai, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi th\u01b0\u01a1ng y\u00eau", "sex": 5}
