{"first_name": "Thanh Quy\u00ean", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Thanh\" l\u00e0 trong s\u1ea1ch, li\u00eam khi\u1ebft. \"Quy\u00ean\" \u00fd ch\u1ec9 c\u00f4 g\u00e1i \u0111\u1eb9p, diu d\u00e0ng v\u00e0 n\u1ebft na, \u0111\u1eb1m th\u1eafm v\u00e0 c\u00f3 hi\u1ec3u bi\u1ebft. T\u00ean \"Thanh Quy\u00ean\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi \u00fd ngh\u0129a xinh \u0111\u1eb9p d\u1ecbu d\u00e0ng, \u0111\u00e1ng y\u00eau, \u0111\u1ee9c h\u1ea1nh, c\u00f3 c\u1ed1t c\u00e1ch trong s\u1ea1ch, thanh cao", "sex": 5}
{"first_name": "Th\u1ea3o Quy\u00ean", "meaning": "Ch\u1eef \"Th\u1ea3o\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 c\u00e2y c\u1ecf, c\u00f2n \"Quy\u00ean\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i chim c\u00f3 ti\u1ebfng h\u00f3t hay, l\u1ea3nh l\u00f3t, th\u01b0\u1eddng th\u1ea5y v\u00e0o m\u00f9a h\u00e8. \"Th\u1ea3o Quy\u00ean\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con lu\u00f4n xinh \u0111\u1eb9p, tr\u00e0n \u0111\u1ea7y s\u1ee9c s\u1ed1ng nh\u01b0 c\u1ecf c\u00e2y, lu\u00f4n vui t\u01b0\u01a1i, ho\u1ea1t b\u00e1t, cu\u1ed9c \u0111\u1eddi con s\u1ebd \u0111\u01b0\u1ee3c t\u1ef1 do bay l\u01b0\u1ee3n.", "sex": 5}
