{"first_name": "T\u1ed1 Quy\u00ean", "meaning": "\u0110\u1ea1i thi h\u00e0o Nguy\u1ec5n Du t\u1eebng n\u00f3i Thu\u00fd Ki\u1ec1u v\u00e0 Thu\u00fd V\u00e2n l\u00e0 hai \u1ea3 \"t\u1ed1 nga\", ch\u1eef \"T\u1ed1\" \u1edf \u0111\u00e2y c\u00f3 ngh\u0129a l\u00e0 ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p. \"T\u1ed1 Quy\u00ean\" \u1edf \u0111\u00e2y c\u00f3 ngh\u0129a l\u00e0 c\u00f4 g\u00e1i xinh \u0111\u1eb9p, trang nh\u00e3, b\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n l\u00e0 ng\u01b0\u1eddi c\u00f3 h\u1ecdc th\u1ee9c, hi\u1ec3u bi\u1ebft. Ngo\u00e0i ra, \"T\u1ed1 Quy\u00ean\" c\u00f2n l\u00e0 lo\u00e0i chim quy\u00ean tr\u1eafng, t\u01b0\u1ee3ng tr\u01b0ng cho ng\u01b0\u1eddi trong s\u00e1ng, hi\u1ec1n l\u00e0nh v\u00e0 r\u1ea5t sang tr\u1ecdng", "sex": 5}
