{"first_name": "Th\u00e1i Y\u00ean", "meaning": "\"Th\u00e1i\" c\u00f3 ngh\u0129a l\u00e0 th\u1eddi v\u1eadn, ho\u00e0n c\u1ea3nh thu\u1eadn l\u1ee3i, may m\u1eafn.\"Th\u00e1i Y\u00ean\" mong con l\u00e0 ng\u01b0\u1eddi lu\u00f4n g\u1eb7p \u0111\u01b0\u1ee3c nhi\u1ec1u may m\u1eafn v\u00e0 th\u00e0nh c\u00f4ng trong cu\u1ed9c s\u1ed1ng", "sex": 5}
{"first_name": "Thanh Y\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 m\u00e0u xanh, tu\u1ed5i tr\u1ebb, c\u00f2n l\u00e0 s\u1ef1 thanh cao, trong s\u1ea1ch, thanh b\u1ea1ch. Ng\u01b0\u1eddi t\u00ean \"Thanh\" th\u01b0\u1eddng c\u00f3 kh\u00ed ch\u1ea5t \u0111i\u1ec1m \u0111\u1ea1m, nh\u1eb9 nh\u00e0ng v\u00e0 cao qu\u00fd. \"Thanh Y\u00ean\" c\u00f3 ngh\u0129a l\u00e0 m\u00e0u xanh b\u00ecnh y\u00ean, lu\u00f4n h\u01b0\u1edbng \u0111\u1ebfn cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean, nh\u1eb9 nh\u00e0ng, th\u01b0 th\u1ea3.", "sex": 5}
