{"first_name": "Thi\u1ec7n Y\u00ean", "meaning": "\"Thi\u1ec7n\" c\u00f3 ngh\u0129a t\u1ed1t l\u00e0nh. \"Thi\u1ec7n Y\u00ean\" con l\u00e0 ng\u01b0\u1eddi mang \u0111\u1ebfn nhi\u1ec1u \u0111i\u1ec1u t\u1ed1t l\u1ea1nh, b\u00ecnh y\u00ean v\u00e0 h\u1ea1nh ph\u00fac cho m\u1ecdi ng\u01b0\u1eddi th\u00e2n.", "sex": 5}
{"first_name": "Thu Y\u00ean", "meaning": "\"Thu\" l\u00e0 m\u00f9a thu, c\u00f2n l\u00e0 s\u1ef1 trong s\u00e1ng xinh \u0111\u1eb9p. V\u1edbi t\u00ean \"Thu Y\u00ean\", ba m\u1eb9 mong con l\u00e0 n\u00e9t \u0111\u1eb9p d\u1ecbu d\u00e0ng c\u1ee7a m\u00f9a thu trong s\u00e1ng v\u00e0 b\u00ecnh y\u00ean.", "sex": 5}
{"first_name": "Th\u1ee5c Y\u00ean", "meaning": "\"Th\u1ee5c\" c\u00f3 ngh\u0129a l\u00e0 trong tr\u1ebbo, hi\u1ec1n l\u00e0nh, t\u1ed1t \u0111\u1eb9p. \"Th\u1ee5c Y\u00ean\" con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p, hi\u1ec1n l\u00e0nh t\u01b0\u01a1ng lai b\u00ecnh y\u00ean t\u1ed1t \u0111\u1eb9p.", "sex": 5}
{"first_name": "Th\u00f9y Y\u00ean", "meaning": "\"Th\u00f9y\" l\u00e0 th\u00f9y m\u1ecb, n\u1ebft na, \u0111\u1ea3m \u0111ang. V\u1edbi t\u00ean \"Th\u00f9y Y\u00ean\", ba m\u1eb9 mong con xinh \u0111\u1eb9p th\u00f9y m\u1ecb n\u1ebft na, l\u00e0 ng\u01b0\u1eddi gi\u1ea3n d\u1ecb c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean, an nh\u00e0n.", "sex": 5}
{"first_name": "Th\u1ee7y Y\u00ean", "meaning": "\"Th\u1ee7y\" l\u00e0 n\u01b0\u1edbc c\u00f3 l\u00fac t\u0129nh l\u1eb7ng, th\u00e2m r\u1ea7m, nh\u01b0ng c\u0169ng c\u00f3 khi d\u1eef d\u1ed9i m\u00e3nh li\u1ec7t. \"Th\u1ee7y Y\u00ean\" - con l\u00e0 ng\u01b0\u1eddi c\u00f3 s\u1ee9c s\u1ed1ng m\u00e3nh li\u1ec7t, m\u1ecdi th\u1eed th\u00e1ch kh\u00f4ng l\u00e0m kh\u00f3 \u0111\u01b0\u1ee3c con, mong cho cu\u1ed9c s\u1ed1ng c\u1ee7a con lu\u00f4n b\u00ecnh y\u00ean t\u1ed1t \u0111\u1eb9p.", "sex": 5}
{"first_name": "Th\u1ee5y Y\u00ean", "meaning": "\"Th\u1ee5y\" th\u1ec3 hi\u1ec7n \u0111\u01b0\u1ee3c s\u1ef1 thanh cao, qu\u00fd ph\u00e1i. \"Th\u1ee5y Y\u00ean\" - con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p gi\u00e0u sang qu\u00fd ph\u00e1i c\u00f3 n\u00e9t \u0111\u1eb9p thanh tao v\u00e0 b\u00ecnh y\u00ean trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
{"first_name": "Tr\u00e0 Y\u00ean", "meaning": "\"Tr\u00e0\" g\u1ee3i \u0111\u1ebfn s\u1ef1 g\u1ea7n g\u0169i, th\u00e2n y\u00eau. \"Tr\u00e0 Y\u00ean\" th\u01b0\u1eddng ch\u1ec9 ng\u01b0\u1eddi xinh \u0111\u1eb9p hi\u1ec1n h\u00f2a d\u1ec5 g\u1ea7n,cu\u1ed9c s\u1ed1ng c\u1ee7a con nh\u1eb9 nh\u00e0ng, lu\u00f4n g\u1eb7p \u0111\u01b0\u1ee3c nhi\u1ec1u \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p v\u00e0 b\u00ecnh y\u00ean trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
