{"first_name": "T\u00fa Y\u00ean", "meaning": "\"T\u00fa\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t l\u00e0 ng\u00f4i sao, v\u00ec tinh t\u00fa l\u1ea5p l\u00e1nh chi\u1ebfu s\u00e1ng tr\u00ean cao. Ngo\u00e0i ra \"t\u00fa\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 dung m\u1ea1o xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau. \"T\u00fa Y\u00ean\" mang \u00fd ngh\u0129a l\u00e0 ng\u01b0\u1eddi con g\u00e1i c\u00f3 dung m\u1ea1o xinh x\u1eafn, d\u1ec5 th\u01b0\u01a1ng, c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh an, vui v\u1ebb, h\u1ea1nh ph\u00fac.", "sex": 5}
{"first_name": "T\u1eed Y\u00ean", "meaning": "T\u1eed l\u00e0 m\u00e0u t\u00edm. T\u00ean con mang ngh\u0129a m\u00e0u t\u00edm y\u00ean b\u00ecnh. C\u00e1i t\u00ean g\u1ee3i ra m\u1ed9t khung c\u1ea3nh n\u00ean th\u01a1 \u0111\u1ea7y l\u00e3ng m\u1ea1n", "sex": 5}
{"first_name": "Tu\u1ec7 Y\u00ean", "meaning": "\"Tu\u1ec7\" c\u00f3 ngh\u0129a l\u00e0 tr\u00ed th\u00f4ng minh, t\u00e0i tr\u00ed. T\u00ean \"Tu\u1ec7\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7, c\u00f3 n\u0103ng l\u1ef1c, t\u01b0 duy, kh\u00f4n lanh, m\u1eabn ti\u1ec7p. \"Tu\u1ec7 Y\u00ean\" - con l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh t\u00e0i tr\u00ed v\u00e0 c\u00f3 n\u0103ng l\u1ef1c t\u01b0 duy t\u1ed1t, con c\u00f3 t\u01b0\u01a1ng lai t\u01b0\u01a1i s\u00e1ng v\u00e0 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean ph\u1eb3ng l\u1eb7ng.", "sex": 5}
{"first_name": "Tuy\u1ebft Y\u00ean", "meaning": "\"Tuy\u1ebft\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, s\u00e1ng ng\u1eddi, m\u1ed9t ph\u1ea9m ch\u1ea5t cao qu\u00fd, thanh tao. \"Tuy\u1ebft Y\u00ean\" con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p trong s\u00e1ng v\u00e0 r\u1ea1ng ng\u1eddi nh\u01b0 tuy\u1ebft, cu\u1ed9c s\u1ed1ng c\u1ee7a con an nh\u00e0n gi\u1ea3n d\u1ecb.", "sex": 5}
{"first_name": "V\u00e2n Y\u00ean", "meaning": "\"V\u00e2n\" theo ngh\u0129a H\u00e1n vi\u1ec7t l\u00e0 m\u00e2y, g\u1ee3i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0 \u0111\u00e1m m\u00e2y tr\u1eafng b\u1ed3ng b\u1ec1nh tr\u00ean tr\u1eddi. Trong m\u1ed9t s\u1ed1 t\u00e1c ph\u1ea9m v\u0103n h\u1ecdc th\u01b0\u1eddng d\u00f9ng \"V\u00e2n\" \u0111\u1ec3 h\u00ecnh dung ra m\u1ed9t m\u1ef9 c\u1ea3nh thi\u00ean nhi\u00ean t\u01b0\u01a1i \u0111\u1eb9p. \"V\u00e2n Y\u00ean\" mang \u00fd ngh\u0129a l\u00e0 \u0111\u00e1m m\u00e2y nh\u1eb9 nh\u00e0ng y\u00ean \u1ea3, mong cu\u1ed9c \u0111\u1eddi c\u1ee7a con c\u0169ng s\u1ebd tho\u1ea3i m\u00e1i v\u00e0 b\u00ecnh y\u00ean.", "sex": 5}
{"first_name": "V\u0129nh Y\u00ean", "meaning": "\"V\u0129nh\" l\u00e0 v\u0129nh vi\u1ec5n , tr\u01b0\u1eddng t\u1ed3n. \"V\u0129nh Y\u00ean\" t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t cho b\u00e9 trai, mong con l\u00e0 ng\u01b0\u1eddi c\u00f3 \u0111\u01b0\u1ee3c s\u1ef1 an nh\u00e0n, lu\u00f4n b\u00ecnh y\u00ean trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
{"first_name": "V\u1ef9 Y\u00ean", "meaning": "\"V\u1ef9\" l\u00e0 s\u1ef1 m\u1ea1nh m\u1ebd, b\u1ea3n l\u0129nh. \"V\u1ef9 Y\u00ean\" - con v\u1eeba l\u00e0 ng\u01b0\u1eddi m\u1ea1nh m\u1ebd b\u1ea3n l\u0129nh v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean h\u1ea1nh ph\u00fac.", "sex": 5}
{"first_name": "Xu\u00e2n Y\u00ean", "meaning": "\"Xu\u00e2n\" l\u00e0 m\u00f9a xu\u00e2n, l\u00e0 ni\u1ec1m vui. \"Xu\u00e2n Y\u00ean\" - con l\u00e0 ni\u1ec1m vui l\u00e0 s\u1ef1 y\u00ean b\u00ecnh v\u00e0 may m\u1eafn c\u1ee7a gia \u0111\u00ecnh.", "sex": 5}
{"first_name": "Y Y\u00ean", "meaning": "\"Y\" l\u00e0 nh\u01b0 v\u1eady. \"Y Y\u00ean\" ch\u1ec9 c\u00f4 g\u00e1i \u0111\u1eb9p nh\u01b0 m\u00e2y kh\u00f3i, d\u1ecbu d\u00e0ng th\u01b0\u1edbt tha.", "sex": 5}
{"first_name": "\u00dd Y\u00ean", "meaning": "\"\u00dd\" l\u00e0 \u00fd nguy\u1ec7n, l\u00e0 mong mu\u1ed1n, th\u1ec3 hi\u1ec7n ni\u1ec1m m\u01a1 \u01b0\u1edbc, kh\u00e1t khao, t\u00e2m nguy\u1ec7n c\u1ee7a con ng\u01b0\u1eddi. T\u00ean \"\u00dd Y\u00ean\" mang \u00fd ngh\u0129a th\u1ec3 hi\u1ec7n ni\u1ec1m mong mu\u1ed1n c\u00f3 \u0111\u01b0\u1ee3c m\u1ed9t cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean, an nhi\u00ean, t\u1ef1 t\u1ea1i.", "sex": 5}
{"first_name": "Ng\u1ecdc Qu\u00fdnh", "meaning": "\"Ng\u1ecdc Qu\u00fdnh\" l\u00e0 vi\u00ean ng\u1ecdc s\u00e1ng ng\u1eddi, ch\u1ec9 v\u00e0o ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p \u0111\u1ebd tuy\u1ec7t m\u1ef9, ph\u1ea5m ch\u1ea5t tuy\u1ec7t v\u1eddi.", "sex": 5}
