{"first_name": "Ph\u1ee5ng Y\u1ebfn", "meaning": "\"Ph\u1ee5ng\" theo ngh\u0129a  H\u00e1n - Vi\u1ec7t l\u00e0 chim ph\u01b0\u1ee3ng - Theo t\u00edn ng\u01b0\u1ee1ng d\u00e2n gian Vi\u1ec7t Nam v\u00e0 c\u00e1c n\u01b0\u1edbc \u00c1 \u0110\u00f4ng kh\u00e1c,  chim ph\u01b0\u1ee3ng l\u00e0 h\u00ecnh t\u01b0\u1ee3ng c\u1ee7a th\u00e1nh nh\u00e2n v\u00e0 c\u1ee7a h\u1ea1nh ph\u00fac.  T\u00ean \"Ph\u1ee5ng\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi ng\u01b0\u1eddi c\u00f3 di\u1ec7n m\u1ea1o ho\u00e0n m\u0129, duy\u00ean d\u00e1ng, ph\u1ea9m ch\u1ea5t \u0111\u1ee9c h\u1ea1nh, c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac v\u00e0 quy\u1ec1n qu\u00fd. \"Y\u1ebfn\" l\u1ea1i l\u00e0 t\u00ean c\u1ee7a 1 lo\u00e0i chim \u0111\u1eb9p, qu\u00fd hi\u1ebfm. T\u00ean \"Ph\u1ee5ng Y\u1ebfn\" \u00fd ch\u1ec9 m\u1ed9t ng\u01b0\u1eddi con g\u00e1i quy\u1ec1n qu\u00fd, c\u00f3 dung m\u1ea1o \u0111\u1eb9p, duy\u00ean d\u00e1ng, thanh cao.", "sex": 5}
