{"first_name": "Ph\u01b0\u1ee3ng Y\u1ebfn", "meaning": "Ph\u01b0\u1ee3ng l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p.Ph\u01b0\u1ee3ng Y\u1ebfn l\u00e0 ng\u01b0\u1eddi nh\u1ecf b\u00e9 nh\u01b0ng bi\u1ebft c\u00e1ch t\u1ecfa s\u00e1ng gi\u1eefa nh\u1eefng ng\u01b0\u1eddi kh\u00e1c, l\u00e0 ng\u01b0\u1eddi c\u00f3 nhi\u1ec7t huy\u1ebft v\u00e0 b\u1ea3n l\u0129nh.", "sex": 5}
{"first_name": "Qu\u00fd Y\u1ebfn", "meaning": "Qu\u00fd l\u00e0 s\u1ef1 gi\u00e0u sang, ph\u00fa qu\u00fd trong t\u01b0\u01a1ng lai. Qu\u00fd Y\u1ebfn mong mu\u1ed1n con xinh \u0111\u1eb9p vui t\u01b0\u01a1i nh\u01b0 m\u00f9a xu\u00e2n v\u00e0 t\u01b0\u01a1ng lai gi\u00e0u sang ph\u00fa qu\u00fd", "sex": 5}
{"first_name": "Quy\u00ean Y\u1ebfn", "meaning": "Quy\u00ean \u00fd ch\u1ec9 c\u00f4 g\u00e1i \u0111\u1eb9p, diu d\u00e0ng v\u00e0 n\u1ebft na, \u0111\u1eb1m th\u1eafm. Quy\u00ean Y\u1ebfn con l\u00e0 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p n\u1ebft na, vui t\u01b0\u01a1i h\u1ed3n nhi\u00ean trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
{"first_name": "Qu\u1ef3nh Y\u1ebfn", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"Qu\u1ef3nh\" l\u00e0 m\u1ed9t vi\u00ean ng\u1ecdc \u0111\u1eb9p v\u00e0 thanh t\u00fa. Ngo\u00e0i ra \"Qu\u1ef3nh\" c\u00f2n l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa lu\u00f4n n\u1edf ng\u00e1t h\u01b0\u01a1ng v\u00e0o ban \u0111\u00eam. T\u00ean \"Qu\u1ef3nh\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi thanh t\u00fa, dung m\u1ea1o xinh \u0111\u1eb9p, b\u1ea3n t\u00ednh khi\u00eam nh\u01b0\u1eddng, thanh cao. T\u00ean\"Qu\u1ef3nh Y\u1ebfn\" ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, thanh t\u00fa v\u1eeba ho\u1ea1t b\u00e1t lanh l\u1ee3i nh\u01b0 chim y\u1ebfn, v\u1eeba c\u00f3 b\u1ea3n t\u00ednh khi\u00eam nh\u01b0\u1eddng, thanh cao.", "sex": 5}
{"first_name": "S\u01a1n Y\u1ebfn", "meaning": "S\u01a1n trong ti\u1ebfng h\u00e1n-vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 n\u00fai, ch\u1ec9 \u0111\u1ed9 cao.S\u01a1n Y\u1ebfn l\u00e0 ng\u01b0\u1edbi c\u00f3 tinh th\u1ea7n hoang d\u00e3, y\u00eau th\u00edch s\u1ef1 m\u1ed9c m\u1ea1c, th\u00f4 s\u01a1 v\u00e0 c\u00e1 t\u00ednh m\u1ea1nh m\u1ebd.", "sex": 5}
{"first_name": "Th\u1ea3o Y\u1ebfn", "meaning": "Th\u1ea3o l\u00e0 c\u00e2y c\u1ecf, c\u00f2n c\u00f3 ngh\u0129a kh\u00e1c l\u00e0 r\u1ed9ng r\u00e3i.Th\u1ea3o Y\u1ebfn l\u00e0 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng bao la, y\u00eau th\u01b0\u01a1ng, chia s\u1ebb v\u00e0 nh\u01b0\u1eddng nh\u1ecbn cho ng\u01b0\u1eddi kh\u00e1c.", "sex": 5}
{"first_name": "Thi\u00ean Y\u1ebfn", "meaning": "Thi\u00ean l\u00e0 tr\u1eddi v\u00e0 Y\u1ebfn l\u00e0 ch\u00fa chim nh\u1ecf.Thi\u00ean Y\u1ebfn l\u00e0 ng\u01b0\u1eddi lu\u00f4n khao kh\u00e1t t\u1ef1 do, y\u00eau h\u00f2a b\u00ecnh, l\u00e0 ng\u01b0\u1eddi c\u00f3 v\u1ebb \u0111\u1eb9p nh\u1eb9 nh\u00e0ng nh\u01b0 s\u1eafc tr\u1eddi v\u00e0o m\u00f9a xu\u00e2n.", "sex": 5}
{"first_name": "Thi\u1ec7n Y\u1ebfn", "meaning": "Thi\u1ec7n c\u00f3 ngh\u0129a t\u1ed1t l\u00e0nh. Thi\u1ec7n Y\u1ebfn con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p v\u00e0 may m\u1eafn mang \u0111\u1ebfn nhi\u1ec1u \u0111i\u1ec1u t\u1ed1t l\u1ea1nh, b\u00ecnh y\u00ean vui v\u1ebb v\u00e0 h\u1ea1nh ph\u00fac cho m\u1ecdi ng\u01b0\u1eddi th\u00e2n.", "sex": 5}
{"first_name": "Thu Y\u1ebfn", "meaning": "Thu l\u00e0 m\u00f9a thu, c\u00f2n l\u00e0 s\u1ef1 trong s\u00e1ng xinh \u0111\u1eb9p. Thu Y\u1ebfn con l\u00e0 n\u00e9t \u0111\u1eb9p d\u1ecbu d\u00e0ng c\u1ee7a m\u00f9a thu trong s\u00e1ng vui t\u01b0\u01a1i nh\u01b0 m\u00f9a xu\u00e2n", "sex": 5}
{"first_name": "Th\u01b0 Y\u1ebfn", "meaning": "\"Th\u01b0\" l\u00e0 tin b\u00e1o. \"Th\u01b0 Y\u1ebfn\" l\u00e0 lo\u00e0i chim nh\u1ecf b\u00e1o tin l\u00e0nh, ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i xinh x\u1eafn duy\u00ean d\u00e1ng, linh \u0111\u1ed9ng \u0111\u00e1ng y\u00eau.", "sex": 5}
{"first_name": "Th\u1ee5c Y\u1ebfn", "meaning": "Th\u1ee5c c\u00f3 ngh\u0129a l\u00e0 trong tr\u1ebbo, hi\u1ec1n l\u00e0nh, t\u1ed1t \u0111\u1eb9p. Th\u1ee5c Y\u1ebfn l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p, c\u00f3 c\u00e1 t\u00ednh v\u00e0 kh\u00ed ch\u1ea5t m\u1ea1nh m\u1ebd.", "sex": 5}
{"first_name": "Th\u1ee7y Y\u1ebfn", "meaning": "Th\u1ee7y l\u00e0 n\u01b0\u1edbc c\u00f3 l\u00fac t\u0129nh l\u1eb7ng, nh\u1eb9 nh\u00e0ng nh\u01b0ng \u0111\u00f4i khi l\u1ea1i tr\u00e0n \u0111\u1ea7y s\u1ee9c s\u1ed1ng m\u00e3nh li\u1ec7t.Th\u1ee7y Y\u1ebfn l\u00e0 ng\u01b0\u1eddi c\u00f3 h\u01b0\u1edbng nh\u1ea1y c\u1ea3m, nhi\u1ec1u c\u1ea3m x\u00fac v\u00e0 h\u01a1i n\u1ed9i t\u00e2m.", "sex": 5}
{"first_name": "Th\u1ee5y Y\u1ebfn", "meaning": "Theo ti\u1ebfng H\u00e1n, \"Th\u1ee5y\" l\u00e0 t\u00ean chung c\u1ee7a ng\u1ecdc khu\u00ea ng\u1ecdc b\u00edch, \u0111\u1eddi x\u01b0a d\u00f9ng ng\u1ecdc \u0111\u1ec3 l\u00e0m tin. T\u00ean \"Th\u1ee5y\" th\u1ec3 hi\u1ec7n \u0111\u01b0\u1ee3c s\u1ef1 thanh cao, qu\u00fd ph\u00e1i. T\u00ean \"Th\u1ee5y\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd xinh \u0111\u1eb9p, sang tr\u1ecdng, cu\u1ed9c s\u1ed1ng sung t\u00fac, vinh hoa. Ngo\u00e0i ra, \"Th\u1ee5y\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 \u0111i\u1ec1m l\u00e0nh, mong mu\u1ed1n cu\u1ed9c s\u1ed1ng b\u00ecnh an, may m\u1eafn, g\u1eb7p \u0111\u01b0\u1ee3c nhi\u1ec1u \u0111i\u1ec1u t\u1ed1t l\u00e0nh. M\u1eb9 \u0111\u1eb7t t\u00ean con l\u00e0 \"Th\u1ee5y Y\u1ebfn\" ngh\u0129a l\u00e0 mong mu\u1ed1n con s\u1ebd xinh \u0111\u1eb9p, th\u00f4ng minh lanh l\u1ee3i nh\u01b0 chim y\u1ebfn, v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh an may m\u1eafn.", "sex": 5}
{"first_name": "Thy Y\u1ebfn", "meaning": "\"Thy\" hay \"Thi\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 th\u01a1, d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng g\u00ec m\u1ec1m m\u1ea1i, nh\u1eb9 nh\u00e0ng. \"Thy\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con g\u00e1i s\u1ebd xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, c\u00f4ng dung ng\u00f4n h\u1ea1nh. \"Thy Y\u1ebfn\" l\u00e0 con chim y\u1ebfn xinh \u0111\u1eb9p, t\u00e0i gi\u1ecfi, c\u1ea7m k\u00ec thi h\u1ecda, c\u00f4ng dung ng\u00f4n h\u1ea1nh.", "sex": 5}
{"first_name": "Ti\u1ec3u Y\u1ebfn", "meaning": "Ti\u1ec3u l\u00e0 nh\u1ecf, \u0111\u00e1ng y\u00eau.Ti\u1ec3u Y\u1ebfn l\u00e0 \u0111\u1ee9a con b\u00e9 b\u1ecfng c\u1ee7a cha m\u1eb9, d\u1ec5 th\u01b0\u01a1ng v\u00e0 bi\u1ebft v\u00e2ng l\u1eddi, l\u00e0 ni\u1ec1m vui cho gia \u0111\u00ecnh.", "sex": 5}
{"first_name": "Tr\u00e0 Y\u1ebfn", "meaning": "\"Tr\u00e0\" l\u00e0 lo\u1ea1i c\u00e2y xanh l\u01b0u ni\u00ean m\u1ecdc th\u00e0nh b\u1ee5i ho\u1eb7c c\u00e1c c\u00e2y nh\u1ecf, \u0111\u01b0\u1ee3c tr\u1ed3ng \u0111\u1ec3 l\u1ea5y l\u00e1. \"Tr\u00e0\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean g\u1ee3i \u0111\u1ebfn s\u1ef1 g\u1ea7n g\u0169i, th\u00e2n y\u00eau. Cha m\u1eb9 mong con xinh \u0111\u1eb9p, m\u1ed9c m\u1ea1c, c\u00f3 s\u1ee9c s\u1ed1ng m\u1ea1nh m\u1ebd, l\u00e0m \u0111\u01b0\u1ee3c nhi\u1ec1u vi\u1ec7c c\u00f3 \u00edch gi\u00fap ng\u01b0\u1eddi, gi\u00fap \u0111\u1eddi. \u0110\u1eb7t t\u00ean \"Tr\u00e0 Y\u1ebfn\" ngh\u0129a l\u00e0 mong mu\u1ed1n con xinh \u0111\u1eb9p, m\u1ed9c m\u1ea1c, gi\u1ea3n d\u1ecb, th\u00f4ng minh lanh l\u1ee3i, l\u00e0m \u0111\u01b0\u1ee3c nhi\u1ec1u vi\u1ec7c gi\u00fap \u00edch cho \u0111\u1eddi", "sex": 5}
{"first_name": "Tr\u1ecdng Y\u1ebfn", "meaning": "Tr\u1ecdng l\u00e0 ng\u01b0\u1eddi c\u00f3 c\u1ed1t c\u00e1ch thanh cao, nghi\u00eam t\u00fac, s\u1ed1ng c\u00f3 \u0111\u1ea1o l\u00fd. Tr\u1ecdng y\u1ebfn mong mu\u1ed1n con v\u1eeba l\u00e0 ng\u01b0\u1eddi gi\u1ecfi giang xinh \u0111\u1eb9p v\u00e0 l\u00e0 ng\u01b0\u1eddi c\u00f3 cu\u1ed9c s\u1ed1ng vui v\u1ebb thanh tao.", "sex": 5}
{"first_name": "Tr\u00fac Y\u1ebfn", "meaning": "Tr\u00fac l\u00e0 m\u1ed9t lo\u00e0i c\u00e2y nh\u1ecf, h\u1ecd v\u1edbi tre, m\u1ea3nh kh\u1ea3nh.Tr\u00fac y\u1ebfn l\u00e0 ng\u01b0\u1eddi c\u00f3 v\u1ebb ngo\u00e0i \u0111\u01a1n gi\u1ea3n, c\u00f3 th\u1ec3 m\u1ea3nh mai nh\u01b0ng lu\u00f4n c\u00f3 l\u00f2ng ki\u00ean tr\u00ec, d\u1ebbo dai b\u1ec1n b\u1ec9 v\u00e0 ch\u1ecbu kh\u00f3.", "sex": 5}
{"first_name": "T\u00fa Y\u1ebfn", "meaning": "T\u00fa trong ti\u1ebfng h\u00e1n - vi\u1ec7t l\u00e0 ng\u00f4i sao, v\u00ec tinh t\u00fa l\u1ea5p l\u00e1nh chi\u1ebfu s\u00e1ng tr\u00ean cao. Ngo\u00e0i ra \"t\u00fa\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 dung m\u1ea1o xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau.T\u00fa Y\u1ebfn l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh, lu\u00f4n c\u1ed1 g\u1eafng v\u01b0\u01a1n l\u00ean v\u00e0 c\u00f3 \u1ef1 nghi\u1ec7p th\u00e0nh c\u00f4ng trong t\u01b0\u01a1ng lai.", "sex": 5}
{"first_name": "Tu\u1ec7 Y\u1ebfn", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Tu\u1ec7\" c\u00f3 ngh\u0129a l\u00e0 tr\u00ed th\u00f4ng minh, t\u00e0i tr\u00ed. T\u00ean \"Tu\u1ec7\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7, c\u00f3 n\u0103ng l\u1ef1c, t\u01b0 duy, kh\u00f4n lanh, m\u1eabn ti\u1ec7p. \u0110\u1eb7t t\u00ean con \"Tu\u1ec7 Y\u1ebfn\" ngh\u0129a l\u00e0 cha m\u1eb9 mong con s\u1ebd l\u00e0 m\u1ed9t con chim y\u1ebfn lanh l\u1ee3i, ho\u1ea1t b\u00e1t, t\u00e0i gi\u1ecfi, th\u00f4ng minh h\u01a1n ng\u01b0\u1eddi.", "sex": 5}
{"first_name": "Uy\u00ean Y\u1ebfn", "meaning": "Uy\u00ean l\u00e0 c\u00f4  duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. Uy\u00ean Y\u1ebfn mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh xinh \u0111\u1eb9p v\u00e0 lu\u00f4n vui v\u1ebb h\u1ed3n nhi\u00ean trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
{"first_name": "V\u00e2n Y\u1ebfn", "meaning": "\"V\u00e2n\" theo ngh\u0129a H\u00e1n vi\u1ec7t l\u00e0 m\u00e2y, g\u1ee3i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0 \u0111\u00e1m m\u00e2y tr\u1eafng b\u1ed3ng b\u1ec1nh tr\u00ean tr\u1eddi. Trong m\u1ed9t s\u1ed1 t\u00e1c ph\u1ea9m v\u0103n h\u1ecdc th\u01b0\u1eddng d\u00f9ng \"V\u00e2n\" \u0111\u1ec3 h\u00ecnh dung ra m\u1ed9t m\u1ef9 c\u1ea3nh thi\u00ean nhi\u00ean t\u01b0\u01a1i \u0111\u1eb9p. \"V\u00e2n Y\u1ebfn\" l\u00e0 con chim y\u1ebfn bay tr\u00ean b\u1ea7u tr\u1eddi t\u01b0\u01a1i \u0111\u1eb9p, t\u1ef1 do, ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, c\u00f3 t\u00e2m h\u1ed3n kho\u00e1ng \u0111\u1ea1t, bay b\u1ed5ng.", "sex": 5}
{"first_name": "V\u00e0nh Y\u1ebfn", "meaning": "V\u00e0nh l\u00e0 g\u1ee3i t\u1ea3 d\u00e1ng v\u1ebb tr\u00f2n \u0111\u1ec1u, \u0111\u1ea7y \u0111\u1eb7n.V\u00e0nh Y\u1ebfn l\u00e0 ng\u01b0\u1eddi c\u00f3 cu\u1ed9c s\u1ed1ng \u0111\u1ea7y \u0111\u1ee7, sung t\u00fac, gia \u0111\u00ecnh h\u00f2a thu\u1eadn \u1ea5m \u00eam.", "sex": 5}
{"first_name": "V\u0169 Y\u1ebfn", "meaning": "\"V\u0169\" c\u00f3 ngh\u0129a l\u00e0 m\u01b0a, l\u00e0 kh\u00fac nh\u1ea1c, c\u0169ng bao h\u00e0m ngh\u0129a v\u1ec1 s\u1ee9c m\u1ea1nh to l\u1edbn. T\u00ean \"V\u0169 Y\u1ebfn\" ngh\u0129a l\u00e0 con chim y\u1ebfn tuy nh\u1ecf b\u00e9, nh\u01b0ng s\u1ee9c s\u1ed1ng m\u1ea1nh m\u1ebd, c\u00f3 th\u1ec3 v\u01b0\u1ee3t qua phong ba b\u00e3o t\u00e1p.", "sex": 5}
{"first_name": "Vy Y\u1ebfn", "meaning": "\"Vy\" mang \u00fd ngh\u0129a l\u00e0 m\u1ed9t c\u00f4 g\u00e1i xinh x\u1eafn, nh\u1ecf b\u00e9 nh\u01b0ng c\u0169ng r\u1ea5t gi\u00e0u s\u1ee9c s\u1ed1ng. T\u00ean Vy Y\u1ebfn g\u1ee3i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng, \u0111\u00e1ng y\u00eau, th\u1ec3 hi\u1ec7n h\u00ecnh \u1ea3nh m\u1ed9t ng\u01b0\u1eddi con g\u00e1i d\u1ec5 th\u01b0\u01a1ng, nh\u1ecf nh\u1eafn, xinh x\u1eafn v\u00e0 \u0111\u00e1ng y\u00eau.", "sex": 5}
