{"first_name": "Duy Quy\u1ec1n", "meaning": "Duy trong ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u01b0 duy, suy ngh\u0129 th\u1ea5u \u0111\u00e1o. \"Quy\u1ec1n\" c\u00f3 ngh\u0129a l\u00e0 quy\u1ec1n l\u1ef1c, s\u1ee9c m\u1ea1nh trong tay ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7, c\u00f3 \u0111\u1ecba v\u1ecb trong x\u00e3 h\u1ed9i. Ngo\u00e0i ra \"Quy\u1ec1n\" c\u00f2n d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi quy\u1ec1n qu\u00fd, cao sang. \u0110\u1eb7t con t\u00ean \"Duy Quy\u1ec1n\" l\u00e0 mong con sau n\u00e0y \u0111\u01b0\u1ee3c t\u00e0i gi\u1ecfi, c\u00f3 quy\u1ec1n l\u1ef1c, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi n\u1ec3 tr\u1ecdng, bi\u1ebft b\u00ecnh t\u0129nh gi\u1ea3i quy\u1ebft v\u1ea5n \u0111\u1ec1 kh\u00f4ng b\u1ed9p ch\u1ed9p h\u00e0nh x\u1eed, c\u00f3 tr\u00ed tu\u1ec7, th\u00f4ng minh & tinh t\u01b0\u1eddng.", "sex": 3}
{"first_name": "Hi\u1ebfu Quy\u1ec1n", "meaning": "Ch\u1eef \"Hi\u1ebfu\" l\u00e0 m\u1ed9t trong nh\u1eefng ch\u1eef \u00fd ngh\u0129a, mang n\u1ec1n t\u1ea3ng \u0111ao \u0111\u1ee9c, g\u1eafn li\u1ec1n v\u1edbi nh\u00e2n c\u00e1ch l\u00e0m ng\u01b0\u1eddi theo t\u01b0 t\u01b0\u1edfng c\u1ee7a ng\u01b0\u1eddi ph\u01b0\u01a1ng \u0110\u00f4ng. \"Hi\u1ebfu\" th\u1ec3 hi\u1ec7n s\u1ef1 t\u00f4n k\u00ednh, qu\u00fd tr\u1ecdng, lu\u00f4n bi\u1ebft \u01a1n, ghi nh\u1edb nh\u1eefng b\u1eadc sinh th\u00e0nh, tr\u01b0\u1edfng b\u1ed1i, c\u00f3 c\u00f4ng \u01a1n v\u1edbi m\u00ecnh. Hi\u1ebfu l\u00e0 hi\u1ebfu th\u1ea3o, hi\u1ebfu k\u00ednh, hi\u1ebfu trung. \"Quy\u1ec1n\" c\u00f3 ngh\u0129a l\u00e0 quy\u1ec1n l\u1ef1c, s\u1ee9c m\u1ea1nh trong tay ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7, c\u00f3 \u0111\u1ecba v\u1ecb trong x\u00e3 h\u1ed9i. Ngo\u00e0i ra \"Quy\u1ec1n\" c\u00f2n d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi quy\u1ec1n qu\u00fd, cao sang. \u0110\u1eb7t con t\u00ean \"Hi\u1ebfu Quy\u1ec1n\" l\u00e0 mong con sau n\u00e0y \u0111\u01b0\u1ee3c t\u00e0i gi\u1ecfi, c\u00f3 quy\u1ec1n l\u1ef1c, c\u00f3 t\u1ea5m l\u00f2ng hi\u1ebfu th\u1ea3o, t\u1eadn trung, t\u1eadn hi\u1ebfu v\u1edbi \u0111\u1ea5t n\u01b0\u1edbc, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi n\u1ec3 tr\u1ecdng.", "sex": 3}
{"first_name": "H\u1eefu Quy\u1ec1n", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t, ch\u1eef \"H\u1eefu\" ngh\u0129a l\u00e0 c\u00f3, \u0111\u1ea7y \u0111\u1ee7. \"Quy\u1ec1n\" c\u00f3 ngh\u0129a l\u00e0 quy\u1ec1n l\u1ef1c, s\u1ee9c m\u1ea1nh trong tay ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7, c\u00f3 \u0111\u1ecba v\u1ecb trong x\u00e3 h\u1ed9i. Ngo\u00e0i ra \"Quy\u1ec1n\" c\u00f2n d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi quy\u1ec1n qu\u00fd, cao sang. \u0110\u1eb7t con t\u00ean \"H\u1eefu Quy\u1ec1n\" l\u00e0 mong con sau n\u00e0y \u0111\u01b0\u1ee3c tr\u00ed tu\u1ec7 to\u00e0n v\u1eb9n, \u0111\u1ea7y \u0111\u1ee7 t\u00e0i n\u0103ng, c\u00f3 quy\u1ec1n l\u1ef1c, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi n\u1ec3 tr\u1ecdng.", "sex": 3}
{"first_name": "Kh\u1ea3i Quy\u1ec1n", "meaning": "\"Kh\u1ea3i\" trong H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 vui m\u1eebng, h\u00e2n hoan. \"Quy\u1ec1n\" c\u00f3 ngh\u0129a l\u00e0 quy\u1ec1n l\u1ef1c, s\u1ee9c m\u1ea1nh trong tay ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7, c\u00f3 \u0111\u1ecba v\u1ecb trong x\u00e3 h\u1ed9i. Ngo\u00e0i ra \"Quy\u1ec1n\" c\u00f2n d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi quy\u1ec1n qu\u00fd, cao sang. \u0110\u1eb7t con t\u00ean \"Kh\u1ea3i Quy\u1ec1n\" l\u00e0 mong con sau n\u00e0y \u0111\u01b0\u1ee3c t\u00e0i gi\u1ecfi, c\u00f3 quy\u1ec1n l\u1ef1c, s\u1ed1ng vui v\u1ebb, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi n\u1ec3 tr\u1ecdng.", "sex": 3}
