{"first_name": "Minh Quy\u1ec1n", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, Minh c\u00f2n c\u00f3 ngh\u0129a ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (b\u00ecnh minh) th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p.  \"Quy\u1ec1n\" c\u00f3 ngh\u0129a l\u00e0 quy\u1ec1n l\u1ef1c, s\u1ee9c m\u1ea1nh trong tay ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7, c\u00f3 \u0111\u1ecba v\u1ecb trong x\u00e3 h\u1ed9i. Ngo\u00e0i ra \"Quy\u1ec1n\" c\u00f2n d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi quy\u1ec1n qu\u00fd, cao sang. \u0110\u1eb7t con t\u00ean \"Minh Quy\u1ec1n\" l\u00e0 mong con sau n\u00e0y \u0111\u01b0\u1ee3c t\u00e0i gi\u1ecfi, th\u00f4ng minh, c\u00f3 quy\u1ec1n l\u1ef1c, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi n\u1ec3 tr\u1ecdng.", "sex": 3}
{"first_name": "Nam Quy\u1ec1n", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. \"Quy\u1ec1n\" c\u00f3 ngh\u0129a l\u00e0 quy\u1ec1n l\u1ef1c, s\u1ee9c m\u1ea1nh trong tay ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7, c\u00f3 \u0111\u1ecba v\u1ecb trong x\u00e3 h\u1ed9i. Ngo\u00e0i ra \"Quy\u1ec1n\" c\u00f2n d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi quy\u1ec1n qu\u00fd, cao sang. \u0110\u1eb7t con t\u00ean \"Nam Quy\u1ec1n\" l\u00e0 mong con sau n\u00e0y \u0111\u01b0\u1ee3c t\u00e0i gi\u1ecfi, th\u00f4ng minh, s\u00e1ng su\u1ed1t, c\u00f3 quy\u1ec1n l\u1ef1c, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi n\u1ec3 tr\u1ecdng", "sex": 3}
{"first_name": "Nh\u00e2n Quy\u1ec1n", "meaning": "Nh\u00e2n trong ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ng\u01b0\u1eddi, thi\u00ean ch\u1ec9 v\u1ec1 ph\u1ea7n t\u00ednh c\u00e1ch v\u00ec Nh\u00e2n c\u00f2n c\u00f3 ngh\u0129a l\u00e0 ph\u1ea7n gi\u00e1 tr\u1ecb c\u1ed1t l\u00f5i b\u00ean trong. V\u00e0 \u1edf m\u1ed9t ngh\u0129a kh\u00e1c Nh\u00e2n c\u00f2n \u00fd ch\u1ec9 s\u1ef1 vi\u1ec7c do con ng\u01b0\u1eddi t\u1ea1o ra, t\u00f9y thu\u1ed9c v\u00e0o h\u00e0nh \u0111\u1ed9ng \u0111\u00f3 m\u00e0 mang l\u1ea1i k\u1ebft qu\u1ea3 t\u1ed1t ho\u1eb7c x\u1ea5u. \"Quy\u1ec1n\" c\u00f3 ngh\u0129a l\u00e0 quy\u1ec1n l\u1ef1c, s\u1ee9c m\u1ea1nh trong tay ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7, c\u00f3 \u0111\u1ecba v\u1ecb trong x\u00e3 h\u1ed9i. Ngo\u00e0i ra \"Quy\u1ec1n\" c\u00f2n d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi quy\u1ec1n qu\u00fd, cao sang. \u0110\u1eb7t con t\u00ean \"Nh\u00e2n Quy\u1ec1n\" l\u00e0 mong con sau n\u00e0y \u0111\u01b0\u1ee3c t\u00e0i gi\u1ecfi, c\u00f3 quy\u1ec1n l\u1ef1c, s\u1ed1ng nh\u00e2n h\u1eadu, l\u01b0\u01a1ng thi\u1ec7n, bi\u1ebft y\u00eau th\u01b0\u01a1ng, lu\u00f4n l\u00e0m vi\u1ec7c t\u1ed1t \u0111\u1ec3 h\u01b0\u1edfng qu\u1ea3 ng\u1ecdt, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi n\u1ec3 tr\u1ecdng.", "sex": 3}
