{"first_name": "\u00c1i Qu\u1ef3nh", "meaning": "\"Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\"\u00c1i\"\" c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a, \"\"Qu\u1ef3nh\"\" l\u00e0 t\u00ean g\u1ecdi c\u1ee7a m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p, ch\u1ec9 n\u1edf khi tr\u1eddi t\u1ed1i, c\u00f3 m\u00e0u tr\u1eafng tinh kh\u00f4i, m\u00f9i h\u01b0\u01a1ng thanh khi\u1ebft, d\u1ecbu d\u00e0ng.\r\n\u0110\u1eb7t con t\u00ean \"\"\u00c1i Qu\u1ef3nh\"\" v\u1edbi \u00fd ngh\u0129a l\u00e0 con s\u1ebd xinh \u0111\u1eb9p nh\u01b0 hoa, nh\u01b0 ng\u1ecdc, hi\u1ec1n th\u1ee5c v\u00e0 \u0111\u01b0\u1ee3c y\u00eau th\u01b0\u01a1ng, chi\u1ec1u chu\u1ed9ng.\"", "sex": 5}
{"first_name": "Anh Qu\u1ef3nh", "meaning": "C\u00e1i t\u00ean kh\u00f4ng ch\u1ec9 \u0111\u01a1n thu\u1ea7n \u0111\u1ec1 c\u1eadp ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p, ki\u00eau sa, duy\u00ean d\u00e1ng nh\u01b0 m\u1ed9t \u0111\u00f3a qu\u1ef3nh, m\u00e0 c\u00f2n h\u01b0\u1edbng t\u1edbi m\u1ed9t t\u00e2m h\u1ed3n thanh tao, m\u1ed9t \u00fd th\u1ee9c t\u1ef1 t\u00f4n, t\u1ef1 tr\u1ecdng v\u00e0 ph\u1ea9m ch\u1ea5t cao qu\u00fd.", "sex": 5}
{"first_name": "\u00c1nh Qu\u1ef3nh", "meaning": "\"\u00c1nh\"  theo ngh\u0129a H\u00e1n Vi\u1ec7t g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng tia s\u00e1ng do m\u1ed9t v\u1eadt ph\u00e1t ra ho\u1eb7c ph\u1ea3n chi\u1ebfu l\u1ea1i, \u00e1nh s\u00e1ng ph\u1ea3n chi\u1ebfu l\u00f3ng l\u00e1nh, soi r\u1ecdi, \"Qu\u1ef3nh\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa ng\u00e1t h\u01b0\u01a1ng th\u01a1m l\u1eebng. Theo truy\u1ec1n thuy\u1ebft, \"Qu\u1ef3nh\" c\u00f2n l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng cho t\u1ea5m l\u00f2ng th\u01a1m th\u1ea3o, nh\u00e2n t\u1eeb. V\u00ec v\u1eady \u0111\u1eb7t t\u00ean \"\u00c1nh Qu\u1ef3nh\" cho con ngo\u00e0i \u00fd ngh\u0129a con s\u1edf h\u1eefu dung m\u1ea1o \u0111\u1eb9p nh\u01b0 \u00e1nh nh\u00ecn c\u1ee7a \u0111\u00f3a hoa qu\u1ef3nh r\u1ef1c r\u1ee1  m\u00e0 c\u00f2n c\u00f3 t\u1ea5m l\u00f2ng nh\u00e2n \u00e1i, th\u1ea3o th\u01a1m h\u01a1n h\u1eb3n ng\u01b0\u1eddi th\u01b0\u1eddng", "sex": 5}
{"first_name": "B\u1ea3o Qu\u1ef3nh", "meaning": "Ch\u1eef \"B\u1ea3o\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 b\u1ea3o b\u1ed1i, b\u1ea3o v\u1eadt, ch\u1ec9 nh\u1eefng \u0111\u1ed3 v\u1eadt c\u00f3 gi\u00e1 tr\u1ecb v\u00e0 qu\u00fd hi\u1ebfm. C\u00f2n \"Qu\u1ef3nh\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p - hoa qu\u1ef3nh, m\u1ed9t lo\u1ea1i hoa th\u01b0\u1eddng n\u1edf v\u00e0o l\u00fac 12 gi\u1edd \u0111\u00eam, hoa c\u00f3 m\u00e0u tr\u1eafng tinh kh\u00f4i, m\u00f9i h\u01b0\u01a1ng thanh khi\u1ebft, d\u1ecbu d\u00e0ng. \"B\u1ea3o Qu\u1ef3nh\" c\u00f3 ngh\u0129a l\u00e0 b\u00f4ng hoa qu\u1ef3nh qu\u00fd gi\u00e1. Con t\u00ean \"B\u1ea3o Qu\u1ef3nh\" g\u1ee3i l\u00ean v\u1ebb \u0111\u1eb9p qu\u00fd ph\u00e1i m\u00e0 d\u1ecbu d\u00e0ng, thu\u1ea7n khi\u1ebft, lu\u00f4n \u0111\u01b0\u1ee3c n\u00e2ng niu, chi\u1ec1u chu\u1ed9ng.", "sex": 5}
{"first_name": "C\u1ea9m Qu\u1ef3nh", "meaning": "\"Qu\u1ef3nh\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa ng\u00e1t h\u01b0\u01a1ng th\u01a1m l\u1eebng. Theo truy\u1ec1n thuy\u1ebft, \"Qu\u1ef3nh\" c\u00f2n l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng cho t\u1ea5m l\u00f2ng th\u01a1m th\u1ea3o, nh\u00e2n t\u1eeb. B\u00ean c\u1ea1nh \u0111\u00f3, theo ngh\u0129a H\u00e1n-Vi\u1ec7t \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. V\u00ec v\u1eady \u0111\u1eb7t t\u00ean \"Qu\u1ef3nh C\u1ea9m\" cho con v\u1edbi \u00fd mu\u1ed1n con mang v\u1ebb \u0111\u1eb9p \u0111a m\u00e0u s\u1eafc v\u00e0 tinh t\u1ebf.", "sex": 5}
