{"first_name": "Giang Qu\u1ef3nh", "meaning": "T\u00ean con th\u1ec3 hi\u1ec7n s\u1ef1 d\u1ecbu d\u00e0ng, nh\u1eb9 ng\u00e0ng, mang n\u00e9t n\u1eef t\u00ednh, v\u1eeba thanh tao, v\u1eeba duy\u00ean d\u00e1ng", "sex": 5}
{"first_name": "Giao Qu\u1ef3nh", "meaning": "ng\u01b0\u1eddi con g\u00e1i xinh x\u1eafn, c\u00f3 v\u1ebb \u0111\u1eb9p v\u00e0 c\u1ed1t c\u00e1ch thanh cao, d\u1ecbu d\u00e0ng", "sex": 5}
