{"first_name": "Hoa Qu\u1ef3nh", "meaning": "M\u01b0\u1ee3n t\u00ean m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p \u0111\u1ec3 \u0111\u1eb7t cho con- \"Hoa Qu\u1ef3nh\" \u0111\u01b0\u1ee3c m\u1ec7nh danh l\u00e0 \"N\u1eef ho\u00e0ng c\u1ee7a b\u00f3ng \u0111\u00eam\", v\u1edbi nh\u1eefng c\u00e1nh tr\u1eafng mong manh, tinh kh\u00f4i, m\u00f9i h\u01b0\u01a1ng thanh khi\u1ebft, d\u1ecbu d\u00e0ng, ch\u1ec9 khoe h\u01b0\u01a1ng s\u1eafc v\u1ebbn v\u1eb9n trong m\u1ed9t \u0111\u00eam r\u1ed3i t\u00e0n. T\u1ef1a nh\u01b0 t\u00ednh ch\u1ea5t c\u1ee7a hoa qu\u1ef3nh, t\u00ean \"Hoa Qu\u1ef3nh\" g\u1ee3i l\u00ean v\u1ebb \u0111\u1eb9p duy\u00ean d\u00e1ng, ki\u00eau sa, thu\u1ea7n khi\u1ebft v\u00e0 \u0111\u00e1ng y\u00eau, lu\u00f4n n\u1ed5i b\u1eadt ca\u0309 v\u1ec1 t\u00e0i n\u0103ng l\u1eabn nhan s\u1eafc.", "sex": 5}
{"first_name": "H\u01b0\u01a1ng Qu\u1ef3nh", "meaning": "\" Theo ngh\u0129a Ti\u1ebfng Vi\u1ec7t, \"\"H\u01b0\u01a1ng\"\" c\u00f3 ngh\u0129a l\u00e0 m\u00f9i h\u01b0\u01a1ng, h\u01b0\u01a1ng th\u01a1m, \"\"Qu\u1ef3nh\"\" l\u00e0 hoa Qu\u1ef3nh- m\u1ed9t lo\u00e0i hoa c\u00f3 m\u00e0u tr\u1eafng tinh kh\u00f4i, c\u00f3 h\u01b0\u01a1ng th\u01a1m d\u1ecbu d\u00e0ng, thanh khi\u1ebft. Hoa qu\u1ef3nh th\u01b0\u1eddng n\u1edf v\u00e0o l\u00fac 12 gi\u1edd \u0111\u00eam.\r\n\"\" H\u01b0\u01a1ng Qu\u1ef3nh\"\" c\u00f3 ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m c\u1ee7a hoa qu\u1ef3nh. C\u00e1i t\u00ean \"\"H\u01b0\u01a1ng Qu\u1ef3nh\"\" c\u00f2n mang \u00fd ngh\u0129a c\u00f4 n\u00e0ng xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, e \u1ea5p hay c\u00f4 g\u00e1i c\u00f3 v\u1ebb \u0111\u1eb9p d\u1ecbu d\u00e0ng, thanh khi\u1ebft \u0111\u1ea7y n\u1eef t\u00ednh gi\u1ed1ng nh\u01b0 h\u01b0\u01a1ng th\u01a1m c\u1ee7a nh\u1eefng b\u00f4ng hoa qu\u1ef3nh ch\u1ec9 t\u1ecfa h\u01b0\u01a1ng khoe s\u1eafc v\u00e0o ban \u0111\u00eam.\"", "sex": 5}
