{"first_name": "Lam Qu\u1ef3nh", "meaning": "\"Lam\" l\u00e0 t\u00ean g\u1ecdi c\u1ee7a m\u1ed9t lo\u1ea1i ng\u1ecdc, c\u00f3 m\u00e0u xanh th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u01b0a chu\u1ed9ng l\u00e0m trang s\u1ee9c cho c\u00e1c \u0111\u1ea5ng tr\u1ecb v\u00ec Ai C\u1eadp c\u1ed5 \u0111\u1ea1i, Ba T\u01b0, \u1ea4n \u0110\u1ed9... v\u00ec m\u00e0u s\u1eafc \u0111\u1ed9c \u0111\u00e1o c\u1ee7a n\u00f3. Ng\u1ecdc Lam c\u00f2n c\u00f3 t\u00e1c d\u1ee5ng tr\u1ecb b\u1ec7nh, mang l\u1ea1i may m\u1eafn cho ng\u01b0\u1eddi mang n\u00f3. \"Qu\u1ef3nh\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa tao nh\u00e3 khi\u00eam nh\u01b0\u1eddng n\u1edf trong \u0111\u00eam, mang h\u01b0\u01a1ng th\u01a1m ng\u1ea1t ng\u00e0o. T\u00ean \"Lam Qu\u1ef3nh\" l\u00e0 \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p nh\u01b0ng kh\u00f4ng ki\u00eau k\u1ef3, b\u1ea3n t\u00ednh khi\u00eam nh\u01b0\u1eddng, t\u00e2m h\u1ed3n thanh tao, trong s\u00e1ng, m\u1ed9t ng\u01b0\u1eddi con g\u00e1i v\u1edbi ph\u1ea9m ch\u1ea5t \u0111\u1eb9p, nh\u01b0 ng\u1ecdc ng\u00e0 qu\u00fd b\u00e1u.", "sex": 5}
{"first_name": "Lan Qu\u1ef3nh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Lan\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa qu\u00fd, c\u00f3 h\u01b0\u01a1ng th\u01a1m v\u00e0 s\u1eafc \u0111\u1eb9p. Qu\u1ef3nh l\u00e0 lo\u00e0i hoa khi\u00eam nh\u01b0\u1eddng n\u1edf v\u1ec1 \u0111\u00eam. T\u00ean \"Lan Qu\u1ef3nh\" mang \u00fd ngh\u0129a con xinh \u0111\u1eb9p, tinh t\u1ebf thanh cao m\u00e0 khi\u00eam nh\u01b0\u1eddng, hi\u1ec1n h\u00f2a, r\u1ea5t quy\u1ebfn r\u0169, thanh cao", "sex": 5}
