{"first_name": "Nam Qu\u1ef3nh", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Quy\u00ean l\u00e0 mong mu\u1ed1n con \u0111\u01b0\u1ee3c xinh \u0111\u1eb9p, thanh cao, khi\u00eam nh\u01b0\u1eddng, hi\u1ec3u bi\u1ebft \u0111\u1ea1o l\u00fd l\u00e0m ng\u01b0\u1eddi", "sex": 5}
{"first_name": "Ng\u00e2n Qu\u1ef3nh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ng\u00e2n\" l\u00e0 ch\u00e2u b\u00e1u ho\u1eb7c v\u1eadt ch\u1ea5t c\u00f3 gi\u00e1 tr\u1ecb, \"Qu\u1ef3nh\" l\u00e0 \u0111\u00f3a hoa qu\u1ef3nh. \"Ng\u00e2n Qu\u1ef3nh\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u00f3a hoa qu\u1ef3nh qu\u00fd gi\u00e1. T\u00ean \"Ng\u00e2n Qu\u1ef3nh\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, duy\u00ean d\u00e1ng, n\u00e9t \u0111\u1eb9p ki\u00eau sa, r\u1ea1ng ng\u1eddi. T\u00ean \"Ng\u00e2n Qu\u1ef3nh\" l\u00e0 th\u1ec3 hi\u1ec7n mong mu\u1ed1n c\u1ee7a cha m\u1eb9 mong con c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng \u1ea5m no, sung t\u00fac", "sex": 5}
