{"first_name": "Nh\u00e3 Qu\u1ef3nh", "meaning": "\"Nh\u00e3\" l\u00e0 s\u1ef1 nh\u00e3 nh\u1eb7n, \u0111\u1eb9p nh\u01b0ng gi\u1ea3n d\u1ecb, kh\u00f4ng c\u1ea7u k\u1ef3, ph\u00f4 tr\u01b0\u01a1ng. \"Nh\u00e3 Qu\u1ef3nh\" l\u00e0 c\u00e1i t\u00ean r\u1ea5t \u0111\u1eb9p v\u00e0 nh\u1eb9 nh\u00e0ng d\u00e0nh cho c\u00e1c b\u00e9 g\u00e1i c\u00f3 n\u00e9t \u0111\u1eb9p thanh t\u00fa, d\u1ecbu d\u00e0ng, khi\u00eam nh\u01b0\u1eddng, lu\u00f4n r\u1ea1ng ng\u1eddi khoe s\u1eafc nh\u01b0 \u0111\u00f3a qu\u1ef3nh", "sex": 5}
{"first_name": "Nh\u01b0 Qu\u1ef3nh", "meaning": "Theo ngh\u0129a Ti\u1ebfng Vi\u1ec7t, \"Nh\u01b0 Qu\u1ef3nh\" c\u00f3 ngh\u0129a l\u00e0 n\u00f3i \u0111\u1ebfn lo\u00e0i hoa qu\u1ef3nh, lo\u00e0i hoa \u0111\u01b0\u1ee3c m\u1ec7nh danh l\u00e0 \"N\u1eef ho\u00e0ng c\u1ee7a b\u00f3ng \u0111\u00eam\". Hoa Qu\u1ef3nh v\u1edbi nh\u1eefng c\u00e1nh tr\u1eafng m\u1ecfng manh, tinh kh\u00f4i, m\u00f9i h\u01b0\u01a1ng thanh khi\u1ebft, d\u1ecbu d\u00e0ng, ch\u1ec9 khoe h\u01b0\u01a1ng s\u1eafc qu\u00fd ph\u00e1i v\u1ebbn v\u1eb9n trong m\u1ed9t \u0111\u00eam r\u1ed3i t\u00e0n. T\u00ean \"Nh\u01b0 Qu\u1ef3nh\" g\u1ee3i l\u00ean v\u1ebb \u0111\u1eb9p duy\u00ean d\u00e1ng, d\u1ecbu d\u00e0ng, thu\u1ea7n khi\u1ebft, \u0111\u00e1ng y\u00eau.", "sex": 5}
{"first_name": "Ph\u01b0\u01a1ng Qu\u1ef3nh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ph\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m, \"Qu\u1ef3nh\" l\u00e0 m\u1ed9t lo\u00e0i hoa c\u1ea3nh \u0111\u1eb9p, \u0111\u01b0\u1ee3c m\u1ec7nh danh l\u00e0 \"N\u1eef ho\u00e0ng c\u1ee7a b\u00f3ng \u0111\u00eam\". Hoa Qu\u1ef3nh co\u0301 nh\u1eefng c\u00e1nh tr\u1eafng m\u1ecfng manh v\u00e0 tinh khi\u1ebft, ch\u1ec9 khoe h\u01b0\u01a1ng s\u1eafc qu\u00fd ph\u00e1i v\u1ebbn v\u1eb9n trong m\u1ed9t \u0111\u00eam r\u1ed3i t\u00e0n. T\u00ean \"Ph\u01b0\u01a1ng Qu\u1ef3nh\" v\u1edbi \u00fd ngh\u0129a con l\u00e0 \u0111\u00f3a hoa \u0111\u1eb9p, t\u1ecfa ng\u00e1t h\u01b0\u01a1ng th\u01a1m ngay c\u1ea3 khi cu\u1ed9c s\u1ed1ng t\u0103m t\u1ed1i nh\u1ea5t.", "sex": 5}
{"first_name": "Th\u00fay Qu\u1ef3nh", "meaning": "\"Ch\u1eef \"\"Th\u00fay\"\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 m\u00e0u xanh, t\u00ean m\u1ed9t lo\u1ea1i ng\u1ecdc qu\u00fd (ph\u1ec9 th\u00fay). \"\"Qu\u1ef3nh\"\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p ch\u1ec9 n\u1edf khi tr\u1eddi t\u1ed1i, m\u00e0u tr\u1eafng tinh kh\u00f4i, m\u00f9i h\u01b0\u01a1ng thanh khi\u1ebft, d\u1ecbu d\u00e0ng.\r\nT\u00ean \"\"Th\u00fay Qu\u1ef3nh\"\" c\u00f3 ngh\u0129a l\u00e0 con s\u1ebd xinh \u0111\u1eb9p v\u00e0 \u0111\u1ea7y s\u1ee9c s\u1ed1ng nh\u01b0 c\u00e2y qu\u1ef3nh xanh bi\u1ebfc, nh\u01b0 hoa, nh\u01b0 ng\u1ecdc. T\u00ean \"\"Th\u00fay Qu\u1ef3nh\"\" th\u00edch h\u1ee3p \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 c\u00f3 m\u1ec7nh H\u1ecfa v\u00ec M\u1ed9c (c\u00e2y qu\u1ef3nh) sinh H\u1ecfa.\"", "sex": 5}
