{"first_name": "\u0110\u00ecnh Quy\u1ebft", "meaning": "\"\u0110\u00ecnh\" l\u00e0 n\u01a1i quan vi\u00ean l\u00e0m vi\u1ec7c. \"\u0110\u00ecnh Quy\u1ebft\" ng\u1ee5 \u00fd ch\u1ec9 con ng\u01b0\u1eddi c\u00f3 t\u00e0i n\u0103ng quy\u1ebft \u0111o\u00e1n ch\u1ed1n quan tr\u01b0\u1eddng.", "sex": 3}
{"first_name": "Thanh Quy\u1ebft", "meaning": "\"Thanh\" l\u00e0 trong s\u1ea1ch. \"Thanh Quy\u1ebft\" l\u00e0 h\u00e0nh \u0111\u1ed9ng t\u1ea9y s\u1ea1ch, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi c\u00f3 \u00fd ch\u00ed n\u0103ng l\u1ef1c m\u1ea1nh m\u1ebd.", "sex": 3}
{"first_name": "\u0110\u00ecnh T\u00e0ng", "meaning": "\"\u0110\u00ecnh\" l\u00e0 n\u01a1i quan vi\u00ean l\u00e0m vi\u1ec7c. \"\u0110\u00ecnh T\u00e0ng\" l\u00e0 kho b\u00e1u quan tr\u01b0\u1eddng, ng\u1ee5 \u00fd con ng\u01b0\u1eddi t\u00e0i n\u0103ng v\u01b0\u1ee3t tr\u1ed9i, \u0111\u01b0\u1ee3c \u0111\u1ec1 cao coi tr\u1ecdng trong \u0111\u1eddi.", "sex": 3}
{"first_name": "Nh\u1eadt T\u1ea3o", "meaning": "\"Nh\u1eadt\" l\u00e0 m\u1eb7t tr\u1eddi. \"Nh\u1eadt T\u1ea3o\" l\u00e0 qu\u00e9t ngang tr\u1eddi, h\u00e0m ngh\u0129a con ng\u01b0\u1eddi kh\u00ed ph\u00e1ch hi\u00ean ngang, t\u00e0i c\u00e1n v\u01b0\u1ee3t b\u1eadc.", "sex": 3}
{"first_name": "C\u00f4ng T\u1ea1ng", "meaning": "\"C\u00f4ng\" l\u00e0 c\u1ee7a chung. \"C\u00f4ng T\u1ea1ng\" l\u00e0 kho chung, h\u00e0m ngh\u0129a ng\u01b0\u1eddi n\u1eafm gi\u1eef nhi\u1ec1u tr\u1ecdng tr\u00e1ch, t\u00e0i \u0111\u1ee9c v\u1eb9n to\u00e0n.", "sex": 3}
{"first_name": "\u0110\u00ecnh T\u0103ng", "meaning": "\"\u0110\u00ecnh\" l\u00e0 n\u01a1i quan vi\u00ean l\u00e0m vi\u1ec7c. \"\u0110\u00ecnh T\u0103ng\" ngh\u0129a l\u00e0 l\u00e0m t\u0103ng gi\u00e1 tr\u1ecb ch\u1ed1n quan tr\u01b0\u1eddng, ch\u1ec9 con ng\u01b0\u1eddi c\u00f3 t\u00e0i n\u0103ng th\u1ef1c th\u1ee5, \u0111\u01b0\u1ee3c c\u00e2n nh\u1eafc tr\u1ecdng d\u1ee5ng.", "sex": 3}
{"first_name": "Khang T\u1ea7n", "meaning": "\"Khang\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 s\u1ef1 y\u00ean \u1ed5n, an b\u00ecnh. T\u1ea7n \u00fd ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i gi\u1ecfi. Khang T\u1ea7n l\u00e0 mong mu\u1ed1n con g\u00e1i ngoan s\u1ebd \u0111\u01b0\u1ee3c b\u00ecnh y\u00ean", "sex": 3}
{"first_name": "An B\u00edch", "meaning": "An l\u00e0 b\u00ecnh y\u00ean. An B\u00edch l\u00e0 \u0111\u00e1 qu\u00fd \u0111\u1ecbnh h\u00ecnh, ch\u1ec9 v\u00e0o ng\u01b0\u1eddi c\u00f3 c\u00e1 t\u00ednh v\u00e0 t\u00e0i c\u00e1n", "sex": 5}
{"first_name": "\u0110an B\u00edch", "meaning": "\"\u0110an B\u00edch\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i. Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, \"\u0110an\" c\u00f3 ngh\u0129a l\u00e0 m\u00e0u \u0111\u1ecf,  xinh \u0111\u1eb9p. \u0110\u1eb7t t\u00ean n\u00e0y cho con, b\u1ed1 m\u1eb9 mong cho con g\u00e1i l\u1edbn l\u00ean xinh \u0111\u1eb9p, cu\u1ed9c s\u1ed1ng s\u1ebd b\u1eb1ng ph\u1eb3ng v\u00e0 may m\u1eafn.", "sex": 5}
{"first_name": "Di B\u00edch", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"B\u00edch\"  l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t lo\u00e0i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng. \"Di\" l\u00e0 vui v\u1ebb, sung s\u01b0\u1edbng. \"Di B\u00edch\" mang \u00fd ngh\u0129a n\u00f3i con l\u00e0 vi\u00ean ng\u1ecdc b\u00edch th\u00edch h\u00f2a h\u1ee3p v\u1edbi b\u1ea7u tr\u1eddi, nh\u1eb9 nh\u00e0ng, th\u01b0 th\u00e1i.", "sex": 5}
{"first_name": "Di\u1ec5m B\u00edch", "meaning": "\"Di\u1ec5m\" \u00fd ch\u1ec9 t\u1ed1t \u0111\u1eb9p, v\u1ebb t\u01b0\u01a1i s\u00e1ng, xinh \u0111\u1eb9p l\u1ed9ng l\u1eaby th\u01b0\u1eddng ng\u1ee5 \u00fd ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p, y\u1ec3u \u0111i\u1ec7u. Ch\u1eef \"B\u00edch\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t lo\u00e0i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng. V\u00ec v\u1eady t\u00ean \"Di\u00ea\u0303m B\u00edch\" du\u0300ng hi\u0300nh a\u0309nh ho\u0300n ngo\u0323c \u0111e\u0323p \u0111\u1ec3 ch\u1ec9 con ng\u01b0\u1eddi v\u1edbi mong mu\u1ed1n m\u1ed9t dung m\u1ea1o xinh \u0111\u1eb9p, s\u00e1ng ng\u1eddi, m\u1ed9t ph\u1ea9m ch\u1ea5t cao qu\u00fd, thanh tao.", "sex": 5}
{"first_name": "Di\u1ec7p B\u00edch", "meaning": "Theo ti\u1ebfng H\u00e1n- Vi\u1ec7t l\u00e0 ch\u1eef \"Di\u1ec7p\" ch\u00ednh l\u00e0 \"l\u00e1\" trong Kim Chi Ng\u1ecdc Di\u1ec7p (d\u1ecbch l\u00e0 c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc).  Ch\u1eef \"B\u00edch\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 lo\u1ea1i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng. V\u00ec v\u1eady, \u0111\u1eb7t t\u00ean \"Di\u1ec7p B\u00edch\" cho con ng\u1ee5 \u00fd mu\u1ed1n n\u00f3i con nh\u01b0 chi\u00ea\u0301c la\u0301 ma\u0300u xanh ngo\u0323c bi\u0301ch quy\u0301 gia\u0301, co nh\u00e0 quy\u1ec1n qu\u00fd sang gi\u00e0u, d\u00f2ng d\u00f5i danh gi\u00e1. B\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n th\u1ec3 hi\u1ec7n mong mu\u1ed1n t\u1ed1t \u0111\u1eb9p c\u1ee7a b\u1ed1 m\u1eb9 \u0111\u1ec3 con m\u00ecnh lu\u00f4n ki\u00eau sa, qu\u00fd ph\u00e1i khi \u0111\u01b0\u1ee3c \u0111\u1eb7t t\u00ean n\u00e0y.", "sex": 5}
{"first_name": "Di\u1ec7u B\u00edch", "meaning": "Di\u1ec7u l\u00e0 k\u1ef3 \u1ea3o. Di\u1ec7u B\u00edch l\u00e0 m\u00e0u xanh k\u1ef3 \u1ea3o, ng\u1ee5 \u00fd con ng\u01b0\u1eddi \u0111\u1eb9p \u0111\u1ebd, v\u1eb9n to\u00e0n", "sex": 5}
{"first_name": "H\u00e0 B\u00edch", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"H\u00e0\" c\u00f3 ngh\u0129a l\u00e0 s\u00f4ng, l\u00e0 n\u01a1i kh\u01a1i ngu\u1ed3n cho m\u1ed9t cu\u1ed9c s\u1ed1ng d\u1ea1t d\u00e0o, sinh \u0111\u1ed9ng. T\u00ean \"H\u00e0\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi m\u1ec1m m\u1ea1i hi\u1ec1n h\u00f2a nh\u01b0 con s\u00f4ng m\u00f9a n\u01b0\u1edbc n\u1ed5i m\u00eanh mang, b\u1ea1t ng\u00e0n. \"H\u00e0\" c\u00f2n \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, t\u00e2m t\u00ednh trong s\u00e1ng. Ch\u1eef \"B\u00edch\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 lo\u1ea1i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, ho\u0103\u0323c ma\u0300u xanh. V\u00ec v\u1eady t\u00ean \"Ha\u0300 B\u00edch\" mang ngh\u0129a d\u00f2ng s\u00f4ng xanh t\u01b0\u01a1i, n\u01a1i b\u1eaft ngu\u1ed3n nh\u1eefng gi\u1ecdt n\u01b0\u1edbc m\u00e1t l\u00e0nh cho cu\u1ed9c s\u1ed1ng. T\u00ean \"H\u00e0 Bi\u0301ch\" nh\u1eb1m ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 d\u00e1ng v\u1ebb xinh \u0111\u1eb9p, trong s\u00e1ng, kh\u00ed ti\u1ebft thanh tao, nh\u01b0 h\u00ecnh \u1ea3nh d\u00f2ng s\u00f4ng ph\u1ea3n chi\u1ebfu \u00e1nh s\u00e1ng lam l\u1ee5c, m\u1ed9t h\u00ecnh \u1ea3nh \u0111\u1ed9c \u0111\u00e1o va\u0300 qu\u00fd gi\u00e1.", "sex": 5}
{"first_name": "H\u1ea3i B\u00edch", "meaning": "Theo ngh\u0129a H\u00e1n, \"H\u1ea3i\" c\u00f3 ngh\u0129a l\u00e0 bi\u1ec3n, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. T\u00ean \"H\u1ea3i\" c\u0169ng th\u1ec3 hi\u1ec7n s\u1ef1 kho\u00e1ng \u0111\u1ea1t, t\u1ef1 do, t\u1ea5m l\u00f2ng r\u1ed9ng m\u1edf nh\u01b0 h\u00ecnh \u1ea3nh c\u1ee7a bi\u1ec3n kh\u01a1i. Ch\u1eef \"B\u00edch\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 lo\u1ea1i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng hay co\u0300n y\u0301 chi\u0309 ma\u0300u xanh. Cha m\u1eb9 \u0111\u1eb7t t\u00ean con l\u00e0 \"H\u1ea3i Bi\u0301ch\" mong mu\u1ed1n con c\u00f3 m\u1ed9t cu\u1ed9c s\u1ed1ng sung s\u01b0\u1edbng, lu\u00f4n trong xanh nh\u01b0 bi\u1ec3n c\u1ea3.", "sex": 5}
{"first_name": "Hi\u1ec1n B\u00edch", "meaning": "\"B\u00edch\" t\u1ee9c m\u00e0u xanh, trong gi\u1ed1ng nh\u01b0 m\u00e0u c\u1ee7a ng\u1ecdc B\u00edch. V\u1edbi t\u00ean \"Hi\u1ec1n B\u00edch\", ba m\u1eb9 kh\u00f4ng nh\u1eefng mu\u1ed1n con l\u1edbn l\u00ean s\u1ebd xinh \u0111\u1eb9p m\u00e0 c\u00f2n c\u00f3 t\u00e2m h\u1ed3n n\u1ed3ng h\u1eadu, d\u1ecbu d\u00e0ng.", "sex": 5}
{"first_name": "Ho\u00e0ng B\u00edch", "meaning": "T\u00ean con mang \u00fd ngh\u0129a h\u1ea1t ng\u1ecdc s\u00e1ng l\u1ea5p l\u00e1nh \u00e1nh v\u00e0ng \u00f3ng xanh bi\u1ebfc, \u00fd ch\u1ec9 t\u01b0\u01a1ng lai t\u1ed1t \u0111\u1eb9p", "sex": 3}
{"first_name": "H\u1ed3ng B\u00edch", "meaning": "\"H\u1ed3ng B\u00edch\" l\u00e0 m\u1ed9t vi\u00ean ng\u1ecdc s\u00e1ng, t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ee9c kh\u1ecfe, h\u1ea1nh ph\u00fac, may m\u1eafn, s\u1ef1 quy\u1ebft \u0111o\u00e1n , lu\u00f4n chi\u1ebfu s\u00e1ng v\u00e0 gi\u00fap \u0111\u1ee1 ng\u01b0\u1eddi kh\u00e1c. Khi ch\u1ecdn t\u00ean hay cho con l\u00e0 \"H\u1ed3ng B\u00edch\", ba m\u1eb9 hi v\u1ecdng con c\u00f3 n\u00e9t \u0111\u1eb9p nh\u00e3 nh\u1eb7n, \u0111\u1eb1m th\u1eafm, cu\u1ed9c s\u1ed1ng h\u1ea1nh ph\u00fac.", "sex": 5}
{"first_name": "Hu\u1ec7 B\u00edch", "meaning": "La\u0300 m\u00f4\u0323t t\u00ean hay th\u01b0\u01a1\u0300ng du\u0300ng \u0111\u0103\u0323t cho con ga\u0301i. \u201cHu\u1ec7\u201d ngoa\u0300i t\u00ean cu\u0309a m\u00f4\u0323t loa\u0300i hoa \u0111\u0103\u0323c bi\u00ea\u0323t, n\u01a1\u0309 v\u00ea\u0300 \u0111\u00eam, co\u0301 kha\u0309 n\u0103ng to\u0309a h\u01b0\u01a1ng v\u00ea\u0300 ban \u0111\u00eam v\u01a1\u0301i mu\u0300i h\u01b0\u01a1ng nga\u0300o nga\u0323t co\u0300n l\u00e0 tr\u00ed tu\u1ec7, \u00fd ch\u1ec9 th\u00f4ng minh s\u00e1ng su\u1ed1t c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u00f2ng th\u01b0\u01a1ng, l\u00f2ng nh\u00e2n \u00e1i. Ch\u1eef \"B\u00edch\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 lo\u1ea1i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi ,d\u00f9ng \u0111\u1ec3 ch\u1ec9 con ng\u01b0\u1eddi v\u1edbi mong mu\u1ed1n m\u1ed9t dung m\u1ea1o xinh \u0111\u1eb9p, s\u00e1ng ng\u1eddi, m\u1ed9t ph\u1ea9m ch\u1ea5t cao qu\u00fd, thanh tao.", "sex": 5}
{"first_name": "Kim B\u00edch", "meaning": "Ch\u1eef \"Kim\" thu\u1ed9c nh\u00f3m \u0111\u00e1 qu\u00fd c\u00f3 ngh\u0129a l\u00e0 s\u00e1ng s\u1ee7a, t\u1ecfa s\u00e1ng, s\u00e1ng l\u1ea1n. \"B\u00edch\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t lo\u00e0i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng. \"Kim B\u00edch\" \u00fd ch\u1ec9 m\u1ed9t lo\u1ea1i ng\u1ecdc c\u00f3 s\u1eafc v\u00e0ng r\u1ea5t hi\u1ebfm trong t\u1ef1 nhi\u00ean, th\u00f4ng th\u01b0\u1eddng nh\u1eefng lo\u1ea1i ng\u1ecdc n\u00e0y mang \u00fd ngh\u0129a gi\u1ea3i to\u1ea3i s\u1ef1 b\u1ebf t\u1eafc gi\u00fap cho t\u00e2m h\u1ed3n thanh th\u1ea3n. B\u1ed1 m\u1eb9 ch\u1ecdn t\u00ean n\u00e0y cho con hi v\u1ecdng con nh\u01b0 h\u00f2n ng\u1ecdc qu\u00fd, c\u00e0ng m\u00e0i d\u0169a c\u00e0ng t\u1ecfa s\u00e1ng v\u00e0 c\u00f3 t\u00e2m t\u00ednh d\u1ecbu d\u00e0ng, t\u00e2m h\u1ed3n trong s\u00e1ng.", "sex": 5}
{"first_name": "Lam B\u00edch", "meaning": "\"Lam\" l\u00e0 t\u00ean g\u1ecdi c\u1ee7a m\u1ed9t lo\u1ea1i ng\u1ecdc, c\u00f3 m\u00e0u  t\u1eeb xanh n\u01b0\u1edbc bi\u1ec3n ng\u1ea3 sang xanh l\u00e1 c\u00e2y, th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u01b0a chu\u1ed9ng l\u00e0m trang s\u1ee9c. Ch\u1eef \"B\u00edch\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 lo\u1ea1i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng. T\u00ean \"Lam Bi\u0301ch\" la\u0300 s\u01b0\u0323 k\u00ea\u0301t h\u01a1\u0323p tinh t\u00ea\u0301 gi\u01b0\u0303a 2 ma\u0300u xanh thu\u00e2\u0300n khi\u00ea\u0301t d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, qu\u00fd ph\u00e1i c\u00f9ng nh\u1eefng ph\u1ea9m ch\u1ea5t cao sang c\u1ee7a b\u1eadc vua ch\u00faa, s\u1ebd mang l\u1ea1i may m\u1eafn, \u0111i\u1ec1m l\u00e0nh cho nh\u1eefng ng\u01b0\u1eddi th\u00e2n y\u00eau.", "sex": 5}
{"first_name": "Nghi\u00eam B\u00edch", "meaning": "Con \u0111\u1eb9p nh\u01b0 vi\u00ean ng\u1ecdc b\u00edch s\u00e1ng ng\u1eddi v\u1edbi d\u00e1ng v\u1ebb oai v\u1ec7, uy nghi\u00eam, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi \u0111\u1ec1u y\u00eau qu\u00fd v\u00e0 k\u00ednh tr\u1ecdng.", "sex": 5}
{"first_name": "Ng\u1ecdc B\u00edch", "meaning": "Ng\u1ecdc B\u00edch \u0111\u01b0\u1ee3c v\u00ed nh\u01b0 v\u00e0ng v\u00e0 kim c\u01b0\u01a1ng c\u1ee7a ph\u01b0\u01a1ng T\u00e2y, ng\u1ecdc b\u00edch l\u00e0 v\u1eadt ph\u1ea9m kh\u00f4ng ch\u1ec9 gi\u00e1 tr\u1ecb v\u1ec1 m\u1eb7t v\u1eadt ch\u1ea5t m\u00e0 c\u00f2n mang m\u1ed9t \u00fd ngh\u0129a t\u00e2m linh \u0111\u1eb7c bi\u1ec7t b\u1edfi s\u1ef1 qu\u00fd hi\u1ebfm c\u1ee7a lo\u00e0i \u0111\u00e1 n\u00e0y. T\u00ean \"Ng\u1ecdc B\u00edch\" ng\u1ee5 \u00fd con l\u00e0 vi\u00ean ng\u1ecdc trong xanh, thu\u1ea7n khi\u1ebft, kh\u00f4ng ch\u1ec9 dung m\u1ea1o thanh tao, cao sang m\u00e0 b\u1ea3n ch\u1ea5t c\u00f2n h\u00e0m ch\u1ee9a v\u1ebb \u0111\u1eb9p ch\u00e2n \u2013 thi\u1ec7n \u2013 m\u1ef9 ti\u00eau bi\u1ec3u c\u1ee7a ng\u01b0\u1eddi ph\u1ee5 n\u1eef", "sex": 5}
{"first_name": "Nguy\u1ec7t B\u00edch", "meaning": "\"Nguy\u1ec7t B\u00edch\" t\u1ee9c l\u00e0 \u00e1nh tr\u0103ng d\u1ecbu d\u00e0ng, trong s\u00e1ng, nh\u1eb9 nh\u00e0ng. Nh\u01b0 h\u00ecnh \u1ea3nh \u0111ong \u0111\u1ea7y c\u1ee7a \u00e1nh tr\u0103ng, b\u1ed1 m\u1eb9 mong h\u1ea1nh ph\u00fac cu\u1ed9c \u0111\u1eddi con s\u1ebd tr\u00f2n \u0111\u1ea7y.", "sex": 5}
{"first_name": "Nh\u00e3 B\u00edch", "meaning": "\"Nh\u00e3\" th\u1ec3 hi\u1ec7n s\u1ef1 tao nh\u00e3. Ch\u1eef \"B\u00edch\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 lo\u1ea1i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng. \"Nh\u00e3 Bi\u0301ch\" l\u00e0 m\u1ed9t t\u00ean r\u1ea5t \u0111\u1eb9p, n\u1ebfu ch\u01b0a bi\u1ebft r\u00f5 v\u1ec1 \u00fd ngh\u0129a c\u1ee7a n\u00f3, th\u00ec m\u1edbi nghe th\u00f4i c\u0169ng th\u1ea5y c\u1ea3m t\u00ecnh v\u1edbi c\u00e1i t\u00ean n\u00e0y. Da\u0300nh t\u0103\u0323ng con my\u0303 danh na\u0300y, b\u00f4\u0301 me\u0323 mong mu\u00f4\u0301n con s\u1ebd l\u00e0 ng\u01b0\u1eddi h\u1ecdc th\u1ee9c uy\u00ean b\u00e1c, ph\u1ea9m h\u1ea1nh \u0111oan ch\u00ednh, n\u00f3i n\u0103ng nho nh\u00e3 nh\u1eb9 nh\u00e0ng.", "sex": 5}
{"first_name": "Nh\u1eadt B\u00edch", "meaning": "Con nh\u01b0 m\u1eb7t tr\u1eddi tr\u00f2n \u0111\u1ea7y \u0111\u1eb7n, trong veo nh\u01b0 h\u00f2n ng\u1ecdc b\u00edch v\u1edbi h\u00e0m \u00fd ch\u1ec9 \u0111i\u1ec1m l\u00e0nh, may m\u1eafn", "sex": 3}
{"first_name": "Nh\u01b0 B\u00edch", "meaning": "\"Nh\u01b0\" trong ti\u1ebfng Vi\u1ec7t l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 so s\u00e1nh. T\u00ean \"Nh\u01b0\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho n\u1eef, g\u1ee3i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0 h\u01b0\u01a1ng nh\u01b0 hoa, nh\u01b0 ng\u1ecdc nh\u01b0 ng\u00e0. \"Nh\u01b0\" trong t\u00ean g\u1ecdi th\u01b0\u1eddng mang \u00fd so s\u00e1nh t\u1ed1t \u0111\u1eb9p. Ch\u1eef \"B\u00edch\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t lo\u00e0i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng. V\u00ec v\u1eady t\u00ean \"Nh\u01b0 B\u00edch\" du\u0300ng \u0111\u00ea\u0309 vi\u0301 von con nh\u01b0 ho\u0300n ngo\u0323c quy\u0301 gia\u0301 cu\u0309a b\u00f4\u0301 me\u0323.", "sex": 5}
{"first_name": "Ph\u01b0\u01a1ng B\u00edch", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t,  \"B\u00edch\" l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t lo\u00e0i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng, \"Ph\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m, ti\u1ebfng th\u01a1m. T\u00ean \"Ph\u01b0\u01a1ng B\u00edch\" d\u00f9ng n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, quy\u1ec1n qu\u00fd, t\u00e2m h\u1ed3n trong s\u00e1ng, c\u00f3 t\u00e0i n\u0103ng, n\u1ebfu \u0111\u01b0\u1ee3c m\u00e0i d\u0169a, r\u00e8n luy\u1ec7n s\u1ebd c\u00e0ng t\u1ecfa s\u00e1ng.", "sex": 5}
{"first_name": "Ph\u01b0\u1ee3ng B\u00edch", "meaning": "\"B\u00edch\" c\u00f3 ngh\u0129a l\u00e0 vi\u00ean ng\u1ecdc ho\u1eb7c l\u00e0 tr\u00f2n \u0111\u1ea7y, nguy\u00ean v\u1eb9n. \"Ph\u01b0\u1ee3ng B\u00edch\" l\u00e0 t\u00ean v\u1edbi mong mu\u1ed1n cho con l\u00e0 ng\u01b0\u1eddi cao qu\u00fd, thanh t\u00fa, \u0111\u1ea7y s\u1ee9c s\u1ed1ng.", "sex": 5}
{"first_name": "Quy\u00ean B\u00edch", "meaning": "Ch\u1eef \"B\u00edch\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t lo\u00e0i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng, \"Quy\u00ean\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn m\u1ed9t lo\u00e0i chim th\u01b0\u1eddng xu\u1ea5t hi\u1ec7n v\u00e0o m\u00f9a h\u00e8, c\u00f3 ti\u1ebfng h\u00f3t l\u1ea3nh l\u00f3t, l\u00e0m xao \u0111\u1ed9ng l\u00f2ng ng\u01b0\u1eddi. T\u00ean \"Quy\u00ean B\u00edch\" \u00fd ch\u1ec9 c\u00f4 g\u00e1i \u0111\u1eb9p, d\u1ecbu d\u00e0ng, n\u1ebft na, \u0111\u1eb1m th\u1eafm v\u00e0 c\u00f3 hi\u1ec3u bi\u1ebft s\u00e2u r\u1ed9ng.", "sex": 5}
{"first_name": "Thanh B\u00edch", "meaning": "\"Thanh\"d\u1ecbch s\u00e1t ngh\u0129a l\u00e0 m\u00e0u xanh, tuy nhi\u00ean thanh c\u00f2n l\u00e0 s\u1ef1 thanh cao, trong s\u1ea1ch, thanh b\u1ea1ch, lu\u00f4n c\u00f3 kh\u00ed ch\u1ea5t \u0111i\u1ec1m \u0111\u1ea1m, nh\u1eb9 nh\u00e0ng v\u00e0 cao qu\u00fd. \"B\u00edch\" \u00fd ch\u1ec9 m\u1ed9t lo\u00e0i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng. V\u1edbi t\u00ean \"Thanh B\u00edch\", ba m\u1eb9 mong con c\u00f3 cu\u1ed9c s\u1ed1ng sang tr\u1ecdng, quy\u1ec1n qu\u00fd nh\u01b0 ch\u00ednh \u00fd ngh\u0129a m\u00e0 vi\u00ean lam ng\u1ecdc mang l\u1ea1i,b\u1ed1 m\u1eb9 mong \u01b0\u1edbc con s\u1ebd c\u00f3 \u0111\u01b0\u1ee3c s\u1ee9c kh\u1ecfe, s\u1ef1 may m\u1eafn, h\u01b0ng v\u01b0\u1ee3ng.", "sex": 5}
{"first_name": "Thi\u00ean B\u00edch", "meaning": "\"Thi\u00ean B\u00edch\" c\u00f3 ngh\u0129a l\u00e0 m\u00e0u xanh, trong xanh, m\u00e0u c\u1ee7a thi\u00ean nhi\u00ean. Cha m\u1eb9 \u0111\u1eb7t t\u00ean con l\u00e0 Thi\u00ean B\u00edch v\u1edbi hy v\u1ecdng con lu\u00f4n t\u01b0\u01a1i tr\u1ebb, c\u00f3 t\u01b0\u01a1ng lai s\u00e1ng l\u1ea1ng.", "sex": 5}
{"first_name": "Tho\u1ea1i B\u00edch", "meaning": "Tho\u1ea1i l\u00e0 l\u1eddi n\u00f3i. Tho\u1ea1i B\u00edch l\u00e0 vi\u00ean \u0111\u00e1 qu\u00fd bi\u1ebft n\u00f3i, h\u00e0m ngh\u0129a cha m\u1eb9 mong con m\u00ecnh l\u00e0 1 vi\u00ean ng\u1ecdc qu\u00fd gi\u00e1 trong \u0111\u1eddi.", "sex": 5}
{"first_name": "Th\u1ee7y B\u00edch", "meaning": "\"Th\u1ee7y B\u00edch\" c\u00f3 ngh\u0129a l\u00e0 d\u00f2ng n\u01b0\u1edbc trong xanh, hi\u1ec1n ho\u00e0 v\u1edbi \"B\u00edch\"l\u00e0 m\u00e0u xanh, trong gi\u1ed1ng nh\u01b0 m\u00e0u c\u1ee7a ng\u1ecdc B\u00edch. \"Thu\u1ef7\" l\u00e0 n\u01b0\u1edbc, d\u00f2ng n\u01b0\u1edbc. \u0110\u1eb7t t\u00ean n\u00e0y cho con b\u1ed1 m\u1eb9 hi v\u1ecdng r\u1eb1ng con s\u1ebd c\u00f3 cu\u1ed9c s\u1ed1ng y\u00ean \u1ed5n, t\u01b0\u01a1i s\u00e1ng.", "sex": 5}
{"first_name": "To\u00e0n B\u00edch", "meaning": "Ng\u1ecdc b\u00edch nguy\u00ean v\u1eb9n, kh\u00f4ng c\u00f3 v\u1ebft. T\u1ec9 d\u1ee5 ho\u00e0n ch\u1ec9nh kh\u00f4ng c\u00f3 khuy\u1ebft t\u1ed5n.", "sex": 3}
{"first_name": "Vi\u1ec7t B\u00edch", "meaning": "T\u00ean \"Vi\u1ec7t\" xu\u1ea5t ph\u00e1t t\u1eeb t\u00ean c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, c\u0169ng c\u00f3 n\u00e9t ngh\u0129a ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi th\u00f4ng minh, \u01b0u vi\u1ec7t. Ch\u1eef \"B\u00edch\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 lo\u1ea1i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng. V\u00ec v\u1eady t\u00ean \"Vi\u00ea\u0323t B\u00edch\" vi\u0301 nh\u01b0 con la\u0300 ho\u0300n ngo\u0323c Vi\u00ea\u0323t s\u00e1ng ng\u1eddi,thu\u00e2\u0300n khi\u00ea\u0301t, la\u0300 ng\u01b0\u1eddi t\u00e0i c\u00e0ng m\u00e0i d\u0169a c\u00e0ng r\u00e8n luy\u1ec7n s\u1ebd c\u00e0ng t\u1ecfa s\u00e1ng.", "sex": 5}
{"first_name": "An Bi\u00ean", "meaning": "An l\u00e0 y\u00ean \u0111\u1ecbnh. An Bi\u00ean l\u00e0 \u0111\u1ecbnh r\u00f5 gi\u1edbi h\u1ea1n, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi chu\u1ea9n m\u1ef1c, nghi\u00eam t\u00fac", "sex": 3}
{"first_name": "\u0110\u00ecnh Bi\u00ean", "meaning": "\u0110\u00ecnh l\u00e0 n\u01a1i quan ch\u1ee9c l\u00e0m vi\u1ec7c. \u0110\u00ecnh Bi\u00ean c\u00f3 ngh\u0129a l\u00e0 theo d\u00f5i, ghi l\u1ea1i ho\u1ea1t \u0111\u1ed9ng ch\u1ed1n cung \u0111\u00ecnh, h\u00e0m \u00fd con c\u00e1i sau n\u00e0y tr\u1edf th\u00e0nh ng\u01b0\u1eddi ki\u1ebfn th\u1ee9c gi\u1ecfi giang, tr\u1ee5 c\u1ed9t cho nh\u1eefng vi\u1ec7c ch\u00ednh y\u1ebfu trong x\u00e3 h\u1ed9i.", "sex": 3}
{"first_name": "\u0110\u1ee9c Bi\u00ean", "meaning": "\u0110\u1ee9c l\u00e0 \u0111\u1ea1o \u0111\u1ee9c. \u0110\u1ee9c Bi\u00ean l\u00e0 s\u00e1ch v\u1edf ghi l\u1ea1i s\u1ef1 \u0111\u1ea1o \u0111\u1ee9c trong cu\u1ed9c s\u1ed1ng, ng\u1ee5 \u00fd con c\u00e1i s\u1ebd tr\u1edf th\u00e0nh ng\u01b0\u1eddi ch\u00ednh tr\u1ef1c, t\u1ed1t \u0111\u1eb9p, nh\u01b0 h\u00ecnh \u1ea3nh \u0111\u1ea1o \u0111\u1ee9c \u0111\u01b0\u1ee3c s\u1eed s\u00e1ch ghi nh\u1eadn.", "sex": 3}
{"first_name": "Ng\u1ecdc Bi\u00ean", "meaning": "Ng\u1ecdc l\u00e0 \u0111\u00e1 qu\u00fd, ph\u1ea9m ch\u1ea5t gi\u00e1 tr\u1ecb. Ng\u1ecdc Bi\u00ean l\u00e0 ghi ch\u00e9p l\u1ea1i nh\u1eefng \u0111i\u1ec1u qu\u00fd gi\u00e1, g\u1ee3i h\u00ecnh \u1ea3nh ng\u01b0\u1eddi c\u00f3 t\u1ed1 ch\u1ea5t t\u1ed1t \u0111\u1eb9p, h\u00e0nh vi cao th\u01b0\u1ee3ng, \u0111\u01b0\u1ee3c ghi nh\u1eadn v\u1edbi \u0111\u1eddi.", "sex": 3}
{"first_name": "Quang Bi\u00ean", "meaning": "Quang l\u00e0 \u00e1nh s\u00e1ng. Quang Bi\u00ean l\u00e0 ghi nh\u1eadn l\u1ea1i \u00e1nh s\u00e1ng, h\u00e0m ngh\u0129a h\u00e0nh vi ng\u01b0\u1eddi c\u00f3 \u0111\u1ea1o \u0111\u1ee9c, ph\u1ea9m ch\u1ea5t t\u1ed1t, nh\u01b0 \u00e1nh s\u00e1ng soi r\u1ecdi nh\u1eadn th\u1ee9c ng\u01b0\u1eddi kh\u00e1c.", "sex": 3}
