{"first_name": "Xu\u00e2n Bi\u00ean", "meaning": "Xu\u00e2n l\u00e0 m\u00f9a xu\u00e2n. Xu\u00e2n Bi\u00ean l\u00e0 s\u00e1ch v\u1edf vi\u1ebft v\u1ec1 m\u00f9a xu\u00e2n, th\u1ec3 hi\u1ec7n t\u00ednh h\u1ecdc th\u1ee9c, ph\u1ea9m ch\u1ea5t trong h\u00e0nh vi, t\u01b0 c\u00e1ch con c\u00e1i m\u00e0 cha m\u1eb9 mong \u0111\u1ee3i.", "sex": 5}
{"first_name": "K\u1ef7 T\u1ea5t", "meaning": "T\u1ea5t l\u00e0 \u0111\u01b0\u01a1ng nhi\u00ean. T\u1ea5t K\u1ef7 l\u00e0 t\u1ef1 m\u00ecnh nghi\u00eam kh\u1eafc t\u1ecf t\u01b0\u1eddng v\u1edbi m\u00ecnh", "sex": 3}
