{"first_name": "Ng\u1ecdc T\u1ea1o", "meaning": "\"Ng\u1ecdc\" l\u00e0 \u0111\u00e1 qu\u00fd. \"Ng\u1ecdc T\u1ea1o\" l\u00e0 l\u00e0m n\u00ean ng\u1ecdc qu\u00fd, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi t\u01b0 ch\u1ea5t gi\u1ecfi giang, s\u00e1ng t\u1ea1o n\u0103ng \u0111\u1ed9ng l\u00e0m n\u00ean th\u00e0nh qu\u1ea3 qu\u00fd gi\u00e1.", "sex": 3}
{"first_name": "L\u1ed9c Binh", "meaning": "L\u1ed9c Binh ngh\u0129a l\u00e0 ng\u01b0\u1eddi l\u00ednh may m\u1eafn, t\u00e0i gi\u1ecfi, th\u1ec3 hi\u1ec7n mong mu\u1ed1n c\u1ee7a m\u1eb9 cha, con c\u00e1i tr\u1edf th\u00e0nh ng\u01b0\u1eddi h\u1eefu \u00edch, t\u1eadn t\u1ee5y v\u00e0 d\u0169ng c\u1ea3m v\u1edbi cu\u1ed9c \u0111\u1eddi.", "sex": 3}
