{"first_name": "\u0110\u1ee9c B\u00ecnh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\u0110\u1ee9c\" t\u1ee9c l\u00e0 ph\u1ea9m h\u1ea1nh, t\u00e1c phong t\u1ed1t \u0111\u1eb9p, quy ph\u1ea1m m\u00e0 con ng\u01b0\u1eddi ph\u1ea3i tu\u00e2n theo, ch\u1ec9 chung nh\u1eefng vi\u1ec7c t\u1ed1t l\u00e0nh l\u1ea5y \u0111\u1ea1o \u0111\u1ec3 l\u1eadp th\u00e2n. \"B\u00ecnh\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 c\u00f4ng b\u1eb1ng, ngang nhau kh\u00f4ng thi\u00ean l\u1ec7ch, c\u00f4ng ch\u00ednh. Ghe\u0301p 2 ch\u01b0\u0303 ta\u0323o tha\u0300nh t\u00ean \"\u0110\u01b0\u0301c Bi\u0300nh\" cho con ha\u0300m y\u0301 b\u00f4\u0301 me\u0323 mong con sau na\u0300y se\u0303 la\u0300 \u0111\u00e2\u0301ng nam nhi s\u00f4\u0301ng \u0111\u01b0\u0301ng \u0111\u0103\u0301n, ngay th\u0103\u0309ng va\u0300 \u0111\u01b0\u0301c \u0111\u00f4\u0323.", "sex": 3}
