{"first_name": "Gia B\u00ecnh", "meaning": "B\u1ed1 m\u1eb9 mong gia \u0111\u00ecnh lu\u00f4n b\u00ecnh an khi c\u00f3 con, con l\u00e0 s\u1ef1 b\u00ecnh an c\u1ee7a gia \u0111\u00ecnh m\u00ecnh \u0111\u1ea5y!", "sex": 3}
{"first_name": "H\u1ea3i B\u00ecnh", "meaning": "Theo ngh\u0129a H\u00e1n, \"H\u1ea3i\" c\u00f3 ngh\u0129a l\u00e0 bi\u1ec3n, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. \"B\u00ecnh\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 c\u00f4ng b\u1eb1ng, ngang nhau kh\u00f4ng thi\u00ean l\u1ec7ch, c\u00f4ng ch\u00ednh. V\u00ec v\u1eady, t\u00ean \"B\u00ecnh\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 c\u1ed1t c\u00e1ch, bi\u1ebft ph\u00e2n \u0111\u1ecbnh r\u1ea1ch r\u00f2i, t\u00ednh kh\u00ed \u00f4n h\u00f2a, bi\u1ebft \u0111i\u1ec1u ph\u1ed1i c\u00f4ng vi\u1ec7c, th\u00e1i \u0111\u1ed9 tr\u01b0\u1edbc cu\u1ed9c s\u1ed1ng lu\u00f4n b\u00ecnh t\u0129nh an \u0111\u1ecbnh. T\u00ean \"H\u1ea3i Bi\u0300nh\" c\u0169ng th\u1ec3 hi\u1ec7n s\u1ef1 kho\u00e1ng \u0111\u1ea1t, t\u1ef1 do, t\u1ea5m l\u00f2ng r\u1ed9ng m\u1edf nh\u01b0 h\u00ecnh \u1ea3nh c\u1ee7a bi\u1ec3n kh\u01a1i.", "sex": 3}
{"first_name": "H\u00f2a B\u00ecnh", "meaning": "\"T\u00ean \"\"H\u00f2a B\u00ecnh\"\" mang \u00fd ngh\u0129a con s\u1ebd lu\u00f4n may m\u1eafn, g\u1eb7p \u0111i\u1ec1u b\u00ecnh an, th\u00e1i \u0111\u1ed9 b\u00ecnh t\u0129nh an \u0111\u1ecbnh tr\u01b0\u1edbc bi\u1ebfn \u0111\u1ed9ng c\u1ee7a cu\u1ed9c s\u1ed1ng, d\u00f9ng t\u00ednh kh\u00ed \u00f4n h\u00f2a m\u00e0 c\u1ea3m h\u00f3a l\u00f2ng ng\u01b0\u1eddi.H\u00f2a B\u00ecnh c\u00f2n l\u00e0 t\u00ean m\u1ed9t t\u1ec9nh mi\u1ec1n n\u00fai thu\u1ed9c v\u00f9ng T\u00e2y B\u1eafc, Vi\u1ec7t Nam - m\u1ed9t v\u00f9ng \u0111\u1ea5t \u0111a d\u00e2n t\u1ed9c, gi\u00e1 tr\u1ecb nh\u00e2n v\u0103n \u0111a d\u1ea1ng, phong ph\u00fa v\u1ec1 phong t\u1ee5c c\u1ee7a c\u1ed9ng \u0111\u1ed3ng c\u01b0 d\u00e2n.\"", "sex": 7}
