{"first_name": "Ng\u00e2n\u00a0 B\u00ecnh", "meaning": "\"Ng\u00e2n Bi\u0300nh\" la\u0300 t\u00ean th\u01b0\u01a1\u0300ng hay du\u0300ng \u0111\u00ea\u0309 \u0111\u0103\u0323t t\u00ean cho be\u0301 ga\u0301i. \"Ng\u00e2n\" ngh\u0129a l\u00e0 ch\u00e2u b\u00e1u, l\u00e0 b\u1ea1c, d\u00f2ng s\u00f4ng, \u00e2m thanh vang xa. \"B\u00ecnh\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 c\u00f4ng b\u1eb1ng, ngang nhau kh\u00f4ng thi\u00ean l\u1ec7ch, c\u00f4ng ch\u00ednh. T\u00ean \"Ng\u00e2n Bi\u0300nh\" c\u00f3 ngh\u0129a l\u00e0 con s\u1ebd l\u00e0 m\u1ed9t d\u00f2ng s\u00f4ng hi\u1ec1n h\u00f2a, xinh \u0111\u1eb9p. C\u00e1i t\u00ean \"Ng\u00e2n Bi\u0300nh\" mang \u00fd ngh\u0129a v\u1ec1 cu\u1ed9c s\u1ed1ng \u0111\u1ea7y \u0111\u1ee7 v\u1ec1 v\u1eadt ch\u1ea5t, l\u1eabn v\u1ebb \u0111\u1eb9p c\u1ee7a t\u1ea5m l\u00f2ng th\u01a1m th\u1ea3o, \u00f4n ho\u0300a.", "sex": 5}
{"first_name": "Ng\u1ecdc B\u00ecnh", "meaning": "Theo H\u00e1n Vi\u1ec7t: \"Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc, \"Bi\u0300nh\" la\u0300 bi\u0300nh y\u00ean, an \u0111i\u0323nh. Gh\u00e9p l\u1ea1i \"Ng\u1ecdc Bi\u0300nh\" c\u00f3 ngh\u0129a l\u00e0 vi\u00ean ng\u1ecdc \u0111\u1eb9p mnag \u00fd ngh\u0129a con l\u00e0 vi\u00ean ng\u1ecdc qu\u00fd m\u00e0 may m\u1eafn b\u1ed1 m\u1eb9 c\u00f3 \u0111\u01b0\u1ee3c. Mong cho con l\u1edbn l\u00ean xinh \u0111\u1eb9p r\u1ea1ng ng\u1eddi & lu\u00f4n an la\u0300nh nh\u01b0 ng\u00e0y con \u0111\u1ebfn v\u1edbi b\u1ed1 m\u1eb9.", "sex": 5}
