{"first_name": "Ninh B\u00ecnh", "meaning": "\"Ninh B\u00ecnh\" l\u00e0 m\u1ed9t t\u1ec9nh n\u1eb1m \u1edf c\u1eeda ng\u00f5 c\u1ef1c nam mi\u1ec1n B\u1eafc v\u00e0 khu v\u1ef1c \u0111\u1ed3ng b\u1eb1ng B\u1eafc B\u1ed9,c\u00f3 ti\u1ec1m n\u0103ng du l\u1ecbch phong ph\u00fa v\u00e0 \u0111a d\u1ea1ng.  Khi sinh ra v\u00e0 l\u1edbn l\u00ean, nhi\u1ec1u ng\u01b0\u1eddi thay \u0111\u1ed5i n\u01a1i sinh s\u1ed1ng. V\u00ec v\u1eady, b\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean theo nguy\u00ean qu\u00e1n cho con v\u1edbi \u00fd ni\u1ec7m t\u01b0\u1edfng nh\u1edb v\u1ec1 qu\u00ea nh\u00e0, ho\u1eb7c c\u00f3 th\u1ec3 \u0111\u00e2y l\u00e0 \u0111\u1ecba \u0111i\u1ec3m g\u1eafn li\u1ec1n v\u1edbi t\u00ecnh y\u00eau b\u1ed1 m\u1eb9 ho\u1eb7c ghi d\u1ea5u k\u1ef7 ni\u1ec7m n\u01a1i con sinh ra \u0111\u1eddi.", "sex": 3}
