{"first_name": "Quang B\u00ecnh", "meaning": "\"Quang\" \u1edf \u0111\u00e2y c\u00f3 ngh\u0129a l\u00e0 s\u00e1ng, \u00e1nh s\u00e1ng, l\u00e0 v\u1ebb vang s\u1ea1ch s\u1ebd. t\u00ean \"B\u00ecnh\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 c\u1ed1t c\u00e1ch, bi\u1ebft ph\u00e2n \u0111\u1ecbnh r\u1ea1ch r\u00f2i, bi\u1ebft \u0111i\u1ec1u ph\u1ed1i c\u00f4ng vi\u1ec7c, th\u00e1i \u0111\u1ed9 tr\u01b0\u1edbc cu\u1ed9c s\u1ed1ng lu\u00f4n b\u00ecnh t\u0129nh an \u0111\u1ecbnh. B\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean n\u00e0y v\u1edbi \u00fd mu\u1ed1n mong con m\u00ecnh th\u00f4ng minh, \u0111\u1ea1t nhi\u1ec1u th\u00e0nh c\u00f4ng, t\u00ednh kh\u00ed \u00f4n h\u00f2a,l\u00e0m r\u1ea1ng ng\u1eddi gia \u0111\u00ecnh.", "sex": 3}
{"first_name": "Qu\u1ea3ng B\u00ecnh", "meaning": "\"\"\"Qu\u1ea3ng B\u00ecnh\"\" l\u00e0 m\u1ed9t t\u1ec9nh duy\u00ean h\u1ea3i thu\u1ed9c v\u00f9ng B\u1eafc Trung B\u1ed9 Vi\u1ec7t Nam c\u00f3 nhi\u1ec1u di t\u00edch l\u1ecbch s\u1eed n\u1ed5i ti\u1ebfng v\u00e0 \u0111\u01b0\u1ee3c thi\u00ean nhi\u00ean ban t\u1eb7ng nhi\u1ec1u danh lam th\u1eafng c\u1ea3nh \u0111\u1eb9p. Khi sinh ra v\u00e0 l\u1edbn l\u00ean, nhi\u1ec1u ng\u01b0\u1eddi thay \u0111\u1ed5i n\u01a1i sinh s\u1ed1ng. V\u00ec v\u1eady, b\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean theo nguy\u00ean qu\u00e1n cho con v\u1edbi \u00fd ni\u1ec7m t\u01b0\u1edfng nh\u1edb v\u1ec1 qu\u00ea nh\u00e0, ho\u1eb7c c\u00f3 th\u1ec3 \u0111\u00e2y l\u00e0 \u0111\u1ecba \u0111i\u1ec3m g\u1eafn li\u1ec1n v\u1edbi t\u00ecnh y\u00eau b\u1ed1 m\u1eb9 ho\u1eb7c ghi d\u1ea5u k\u1ef7 ni\u1ec7m n\u01a1i con sinh ra \u0111\u1eddi.\r\n\"", "sex": 3}
