{"first_name": "B\u00ecnh Chi", "meaning": "B\u00ecnh theo ti\u1ebfng H\u00e1n - Vi\u00ea\u0323t, c\u00f3 ngh\u0129a l\u00e0 c\u00f4ng b\u1eb1ng, ngang nhau kh\u00f4ng thi\u00ean l\u1ec7ch, c\u00f4ng ch\u00ednh. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i; l\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p, \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. \"B\u00ecnh Chi\" \u00fd ch\u1ec9 l\u00e0 s\u1ef1 \u00eam th\u1ea5m, c\u1ea3m gi\u00e1c th\u01b0 th\u00e1i hay ch\u1ec9 v\u1ec1 h\u00f2a kh\u00ed, v\u1eadn h\u1ea1n.", "sex": 5}
