{"first_name": "Giang Chi", "meaning": "\"Giang Chi\" l\u00e0 t\u00ean th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i v\u1edbi \"Giang\" l\u00e0 d\u00f2ng s\u00f4ng, th\u01b0\u1eddng ch\u1ec9 nh\u1eefng \u0111i\u1ec1u cao c\u1ea3, l\u1edbn lao. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i; l\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p, \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc.", "sex": 5}
{"first_name": "H\u1ea1 Chi", "meaning": "Theo c\u00e1ch th\u00f4ng th\u01b0\u1eddng, \"H\u1ea1\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u00f9a h\u00e8, m\u1ed9t trong nh\u1eefng m\u00f9a s\u00f4i n\u1ed5i v\u1edbi nhi\u1ec1u ho\u1ea1t \u0111\u1ed9ng vui v\u1ebb c\u1ee7a n\u0103m. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i; l\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p, \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. T\u00ean \"H\u1ea1 Chi\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 v\u1ebb ngo\u00e0i thu h\u00fat, l\u00e0 trung t\u00e2m c\u1ee7a m\u1ecdi s\u1ef1 v\u1eadt, s\u1ef1 vi\u1ec7c, r\u1ea1ng r\u1ee1 nh\u01b0 m\u00f9a h\u00e8. V\u00e0 \u1edf m\u1ed9t ngh\u0129a kh\u00e1c theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"H\u1ea1\" c\u00f2n \u0111\u01b0\u1ee3c hi\u1ec3u l\u00e0 s\u1ef1 an nh\u00e0n, r\u00e3nh r\u1ed7i, ch\u1ec9 s\u1ef1 th\u01b0 th\u00e1i nh\u1eb9 nh\u00e0ng trong nh\u1eefng ph\u00fat gi\u00e2y ngh\u1ec9 ng\u01a1i.", "sex": 5}
{"first_name": "H\u1ea1nh Chi", "meaning": "\"H\u1ea1nh\" trong C\u00f4ng-Dung-Ng\u00f4n-H\u1ea1nh, l\u00e0 m\u1ed9t trong b\u1ed1n \u0111i\u1ec3m t\u1ed1t c\u1ee7a ng\u01b0\u1eddi ph\u1ee5 n\u1eef th\u1eddi x\u01b0a \u00fd ch\u1ec9 t\u00ednh n\u1ebft t\u1ed1t. D\u00f9ng \"H\u1ea1nh\" l\u00e0m ch\u1eef l\u00f3t cho t\u00ean \"Chi\" ng\u1ee5 \u00fd con l\u00e0 ng\u01b0\u1eddi con g\u00e1i d\u00f2ng d\u00f5i danh gi\u00e1, c\u00f3 ph\u1ea9m h\u1ea1nh, n\u1ec1n n\u1ebfp t\u1ed1t \u0111\u1eb9p. \u0110\u00e2y la\u0300 m\u1ed9t ng\u01b0\u1eddi v\u1edbi t\u1ea5m l\u00f2ng nh\u00e2n \u00e1i lu\u00f4n nu\u00f4i d\u01b0\u1ee1ng nh\u1eefng suy ngh\u0129 t\u1ed1t \u0111\u1eb9p v\u00e0 theo l\u1ebd ph\u1ea3i.", "sex": 5}
{"first_name": "Hi\u1ec3n Chi", "meaning": "Hi\u1ec3n l\u00e0 th\u1ec3 hi\u1ec7n ra. Hi\u1ec3n Chi ngh\u0129a l\u00e0 c\u00e0nh l\u00e1 r\u00f5 r\u00e0ng, ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p \u0111\u1ebd, thu\u1ea7n h\u1eadu.", "sex": 5}
{"first_name": "Hoa Chi", "meaning": "Hoa l\u00e0 s\u1ef1 k\u1ebft tinh \u0111\u1eb9p \u0111\u1ebd c\u1ee7a tr\u1eddi \u0111\u1ea5t, hoa mang \u0111\u1ebfn s\u1ef1 sinh \u0111\u1ed9ng & t\u00f4 \u0111i\u1ec3m s\u1eafc m\u00e0u cho cu\u1ed9c s\u1ed1ng. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i; l\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p, \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. T\u00ean \"Hoa Chi\" \u00fd ch\u1ec9 nh\u00e0nh hoa \u0111\u1eb9p, \u0111\u1ea7y s\u1ee9c s\u1ed1ng, th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho n\u1eef, ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi con g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, thu h\u00fat.", "sex": 5}
{"first_name": "Ho\u00e0ng Chi", "meaning": "\"Ho\u00e0ng Chi\" t\u1ee9c nh\u00e1nh c\u00e2y m\u00e0u v\u00e0ng \u00f3ng \u00e1nh, r\u1ef1c r\u1ee1 n\u00f3i l\u00ean \u00fd ngh\u0129a s\u1ef1 s\u1ed1ng. \u0110\u1eb7t t\u00ean n\u00e0y cho con, b\u1ed1 m\u1eb9 h\u00e0m \u00fd con c\u00f3 t\u1ea5m l\u00f2ng khoan dung nh\u00e2n \u00e1i, lu\u00f4n lu\u00f4n mang \u0111\u1ebfn ni\u1ec1m vui ph\u1ea5n kh\u1edfi cho \u0111\u1eddi. Ngo\u00e0i ra, \"Ho\u00e0ng Chi\" c\u00f2n h\u00e0m ch\u1ee9a \u00fd ch\u1ec9 ng\u01b0\u1eddi con c\u1ee7a d\u00f2ng d\u00f5i cao sang, danh gia v\u1ecdng t\u1ed9c.", "sex": 5}
{"first_name": "H\u1ed3ng Chi", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"H\u1ed3ng\" l\u00e0 \u00fd ch\u1ec9 m\u00e0u \u0111\u1ecf, m\u00e0 m\u00e0u \u0111\u1ecf v\u1ed1n th\u1ec3 hi\u1ec7n cho ni\u1ec1m vui, s\u1ef1 may m\u1eafn, c\u00e1t t\u01b0\u1eddng. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i; l\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p, \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. Theo th\u00f3i quen \u0111\u1eb7t t\u00ean c\u1ee7a ng\u01b0\u1eddi Vi\u1ec7t, t\u00ean H\u1ed3ng Chi th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con g\u00e1i, g\u1ee3i l\u00ean h\u00ecnh \u1ea3nh nh\u00e0nh c\u00e2y gi\u00e0u s\u1ee9c s\u1ed1ng, t\u01b0\u01a1i vui, xinh \u0111\u1eb9p.", "sex": 5}
{"first_name": "Hu\u1ec7 Chi", "meaning": "L\u1ea5y h\u00ecnh \u1ea3nh nh\u00e0nh hoa Hu\u1ec7 th\u01b0\u1eddng \u0111\u01b0\u1ee3c t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1  tinh khi\u1ebft, v\u1edbi t\u00ean \"Hu\u1ec7 Chi\" th\u1ec3 hi\u1ec7n mong mu\u1ed1n c\u1ee7a cha m\u1eb9 con s\u1ebd c\u00f3 t\u00e2m kh\u00ed trong s\u1ea1ch, thanh cao.", "sex": 5}
{"first_name": "H\u01b0\u01a1ng Chi", "meaning": "\"H\u01b0\u01a1ng\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c ch\u1ecdn \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho con g\u00e1i v\u1edbi \u00fd ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m, c\u00f2n \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i. \"H\u01b0\u01a1ng Chi\" kh\u00f4ng ch\u1ec9 th\u1ec3 hi\u1ec7n \u0111\u01b0\u1ee3c s\u1ef1 d\u1ecbu d\u00e0ng, quy\u1ebfn r\u0169, thanh l\u1ecbch v\u00e0 \u0111\u1eb1m th\u1eafm c\u1ee7a ng\u01b0\u1eddi con g\u00e1i m\u00e0 c\u00f2n ng\u1ee5 \u00fd s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc.", "sex": 5}
{"first_name": "Hy Chi", "meaning": "Hy c\u00f3 ngh\u0129a l\u00e0 vui v\u1ebb, s\u00e1ng r\u00f5. Hy Chi ngh\u0129a l\u00e0 c\u00e0nh c\u00e2y vui v\u1ebb, ng\u1ee5 \u00fd con ng\u01b0\u1eddi nh\u01b0 1 \u0111i\u1ec3m t\u1ee5 h\u1ed9i ni\u1ec1m vui, s\u1ef1 th\u00e0nh \u0111\u1ea1t trong \u0111\u1eddi, lu\u00f4n c\u00f3 nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p t\u00ecm \u0111\u1ebfn.", "sex": 3}
{"first_name": "Kh\u1ea3 Chi", "meaning": "\"Kh\u1ea3 Chi\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean \u0111\u1eb9p \u0111\u1eb7t cho con g\u00e1i. \"Kh\u1ea3\" th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i c\u00f3 n\u00e9t \u0111\u1eb9p d\u1ecbu d\u00e0ng, m\u1ec1m m\u1ea1i v\u1edbi t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, h\u00f2a nh\u00e3. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh, trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i. Khi b\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean n\u00e0y cho con, mong mu\u1ed1n sau n\u00e0y l\u1edbn l\u00ean con s\u1ebd tr\u1edf th\u00e0nh m\u1ed9t c\u00f4 g\u00e1i \u0111\u1eb9p ng\u01b0\u1eddi, \u0111\u1eb9p n\u1ebft \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi qu\u00fd m\u1ebfn y\u00eau th\u01b0\u01a1ng.", "sex": 5}
{"first_name": "Kh\u1ea3i Chi", "meaning": "\"Kh\u1ea3i\" trong H\u00e1n - Vi\u1ec7t, c\u00f3 ngh\u0129a l\u00e0 vui m\u1eebng, h\u00e2n hoan. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i; l\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p, \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. T\u00ean \"Kh\u1ea3i Chi\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi vui v\u1ebb, ho\u1ea1t b\u00e1t, n\u0103ng \u0111\u1ed9ng,", "sex": 7}
{"first_name": "Kh\u00e1nh Chi", "meaning": "Con nh\u01b0 chi\u1ebfc chu\u00f4ng lu\u00f4n reo vang mang ni\u1ec1m vui kh\u1eafp mu\u00f4n n\u01a1i. \u0110\u1eb7t t\u00ean n\u00e0y cho con, b\u1ed1 m\u1eb9 mong mu\u1ed1n con t\u1eadn h\u01b0\u1edfng cu\u1ed9c s\u1ed1ng v\u1edbi \u0111\u1ea7y \u0103\u0301p ni\u1ec1m vui v\u00e0 ti\u1ebfng c\u01b0\u1eddi.", "sex": 5}
{"first_name": "Ki\u1ec1u Chi", "meaning": "Ki\u1ec1u l\u00e0 cao l\u1edbn, d\u1ef1ng l\u00ean. Ki\u1ec1u Chi v\u00ed nh\u01b0 chi\u1ebfc c\u1ea7u n\u1ed1i \u0111\u1eb9p \u0111\u1ebd, ho\u00e0n m\u1ef9, ng\u1ee5 \u00fd con c\u00e1i l\u00e0 s\u1ef1 n\u1ed1i k\u1ebft \u0111\u1eb9p \u0111\u1ebd, h\u1ea1nh ph\u01b0\u1edbc.", "sex": 5}
{"first_name": "Kim Chi", "meaning": "\u201cC\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc\u201d l\u00e0 c\u00e2u n\u00f3i \u0111\u1ec3 ch\u1ec9 s\u1ef1 ki\u1ec1u di\u1ec5m, qu\u00fd ph\u00e1i. Kim Chi ch\u00ednh l\u00e0 C\u00e0nh v\u00e0ng.", "sex": 5}
{"first_name": "Lam Chi", "meaning": "\"Lam\" l\u00e0 t\u00ean g\u1ecdi c\u1ee7a m\u1ed9t lo\u1ea1i ng\u1ecdc, c\u00f3 m\u00e0u t\u1eeb xanh n\u01b0\u1edbc bi\u1ec3n ng\u1ea3 sang xanh l\u00e1 c\u00e2y. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i; l\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p, \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. T\u00ean \"Lam Chi\" v\u00ed nh\u01b0 nh\u00e1nh c\u00e2y xanh t\u1ed1t, th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con g\u00e1i v\u1edbi mong mu\u1ed1n con l\u1edbn l\u00ean dung m\u1ea1o xinh \u0111\u1eb9p, t\u00e2m h\u1ed3n thanh cao, t\u00ednh t\u00ecnh d\u1ecbu d\u00e0ng, nh\u1eb9 nh\u00e0ng.", "sex": 5}
{"first_name": "Lan Chi", "meaning": "Con nh\u01b0 nh\u00e0nh lan qu\u00fd gi\u00e1, c\u00f3 hoa \u0111\u1eb9p v\u00e0 th\u01a1m n\u1edf v\u00e0o m\u00f9a xu\u00e2n. B\u1ed1 m\u1eb9 hy v\u1ecdng v\u00e0 \u01b0\u1edbc mong Lan Chi s\u1ebd l\u00e0 b\u00f4ng hoa lan \u0111\u1eb9p co\u0301 \u0111u\u0309 ca\u0309 \u0111\u1ea1o \u0111\u1ee9c v\u00e0 t\u00e0i n\u0103ng.", "sex": 5}
{"first_name": "L\u1ec7 Chi", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, t\u00ean \"L\u1ec7\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 dung m\u1ea1o xinh \u0111\u1eb9p c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i. \"L\u1ec7 Chi\" \u00fd ch\u1ec9 ng\u01b0\u1eddi \u0111\u1eb9p cao sang qu\u00fd ph\u00e1i.", "sex": 5}
{"first_name": "Li\u1ec5u Chi", "meaning": "Li\u1ec5u l\u00e0 m\u1ec1m m\u1ea1i. Li\u1ec5u Chi mang h\u00ecnh \u1ea3nh 1 chi\u1ebfc c\u1ea7u m\u1ec1m m\u1ea1i, nh\u1eb9 nh\u00e0ng, thanh tho\u00e1t, n\u1ed1i k\u1ebft \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p.", "sex": 5}
{"first_name": "Linh Chi", "meaning": "\"Linh Chi\" l\u00e0 t\u00ean m\u1ed9t lo\u1ea1i n\u1ea5m qu\u00fd s\u1ed1ng \u1edf v\u00f9ng n\u00fai cao \u0111\u01b0\u1ee3c ph\u00e1t hi\u1ec7n nh\u01b0 m\u1ed9t v\u1ecb thu\u1ed1c c\u00f3 nhi\u1ec1u c\u00f4ng d\u1ee5ng. T\u00ean Linh Chi c\u0169ng th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho b\u00e9 g\u00e1i v\u1edbi mong mu\u1ed1n con m\u00ecnh m\u1ea1nh kh\u1ecfe kh\u00f4ng g\u1eb7p tai \u01b0\u01a1ng b\u1ec7nh t\u1eadt.", "sex": 5}
{"first_name": "Mai Chi", "meaning": "V\u00ec nh\u01b0 c\u00e0nh mai m\u1ecfng manh, con c\u1ee7a b\u1ed1 m\u1eb9 lu\u00f4n duy\u00ean d\u00e1ng, y\u1ec3u \u0111i\u1ec7u v\u00e0 thanh tao", "sex": 5}
{"first_name": "M\u1eabn Chi", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"M\u1eabn\" c\u00f3 ngh\u0129a l\u00e0 ch\u0103m ch\u1ec9, nhanh nh\u1eb9n. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i; l\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p, \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. T\u00ean \"M\u1eabn Chi\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi ch\u0103m ch\u1ec9, c\u1ea7n m\u1eabn, si\u00eang n\u0103ng, lu\u00f4n bi\u1ebft c\u1ed1 g\u1eafng v\u00e0 n\u1ed7 l\u1ef1c h\u1ebft m\u00ecnh \u0111\u1ec3 \u0111\u1ea1t \u0111\u01b0\u1ee3c nh\u1eefng m\u1ee5c ti\u00eau s\u1ed1ng v\u00e0 gi\u00fap \u0111\u1ee1 m\u1ecdi ng\u01b0\u1eddi", "sex": 5}
{"first_name": "Mi\u00ean Chi", "meaning": "\"Mi\u00ean\" trong t\u1eeb \"M\u1ed9c Mi\u00ean\" l\u00e0 t\u00ean g\u1ecdi kh\u00e1c c\u1ee7a Hoa G\u1ea1o, c\u00f3 m\u00e0u \u0111\u1ecf r\u1ef1c, n\u1edf v\u00e0o m\u00f9a h\u00e8. M\u1ed7i khi hoa g\u1ea1o r\u1ee5ng xu\u1ed1ng, c\u00e1c s\u1ee3i b\u00f4ng c\u1ee7a qu\u1ea3 g\u1ea1o bay ra r\u1ea5t \u0111\u1eb9p. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i. L\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc.\r\n\"Mi\u00ean Chi\" l\u00e0 s\u1ef1 k\u1ebft h\u1ee3p \u0111\u1ed9c \u0111\u00e1o \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i, v\u1edbi mong mu\u1ed1n khi l\u1edbn l\u00ean con s\u1ebd tr\u1edf th\u00e0nh c\u00f4 g\u00e1i xinh \u0111\u1eb9p, chung th\u1ee7y", "sex": 5}
{"first_name": "Minh Chi", "meaning": "V\u1edbi t\u00ean \"Minh Chi\",ba m\u1eb9 mong con s\u1ebd l\u00e0 ng\u01b0\u1eddi s\u1ed1ng minh b\u1ea1ch, ngay th\u1eb3ng, r\u00f5 r\u00e0ng. V\u1edbi t\u00e2m trong s\u00e1ng, con hi\u1ec3u r\u00f5 l\u1ebd s\u1ed1ng b\u00ecnh y\u00ean n\u01a1i t\u00e2m h\u1ed3n, l\u00f2ng y\u00ean \u1ed5n th\u01b0 th\u1ea3, kh\u00f4ng lo ngh\u0129.", "sex": 5}
{"first_name": "M\u1ed9c Chi", "meaning": "\"M\u1ed9c\" trong ti\u1ebfng H\u00e1n Vi\u00ea\u0323t c\u00f3 ngh\u0129a l\u00e0 g\u1ed7. Trong t\u00ednh c\u00e1ch M\u1ed9c \u0111\u01b0\u1ee3c hi\u1ec3u l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i, l\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p, \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. \u0110\u1eb7t t\u00ean \"M\u1ed9c Chi\" cha m\u1eb9 mong con s\u1ed1ng gi\u1ea3n d\u1ecb, h\u1ed3n h\u1eadu, ch\u1ea5t ph\u00e1c, kh\u00f4ng ganh \u0111ua, bon chen, co\u0301 m\u1ed9t cu\u1ed9c s\u1ed1ng b\u00ecnh d\u1ecb, an nh\u00e0n, t\u00e2m t\u00ednh chan h\u00f2a, th\u00e2n \u00e1i.", "sex": 5}
{"first_name": "M\u1ef9 Chi", "meaning": "\"M\u1ef9 Chi\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean \u0111\u1eb9p \u0111\u1eb7t cho con g\u00e1i. \"M\u1ef9\" theo ti\u1ebfng H\u00e1n ngh\u0129a l\u00e0 \"\u0111\u1eb9p\" th\u01b0\u1eddng th\u1ea5y trong c\u00e1c t\u1eeb m\u1ef9 nh\u00e2n, m\u1ef9 n\u1eef. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh, trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i. Khi b\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean n\u00e0y cho con, mong mu\u1ed1n sau n\u00e0y l\u1edbn l\u00ean con s\u1ebd tr\u1edf th\u00e0nh m\u1ed9t c\u00f4 g\u00e1i \u0111\u1eb9p ng\u01b0\u1eddi, \u0111\u1eb9p n\u1ebft thanh cao, qu\u00fd ph\u00e1i.", "sex": 5}
{"first_name": "Ng\u1ecdc Chi", "meaning": "\"Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh, th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed,\" Chi\" l\u00e0Trong ti\u1ebfng H\u00e1n - Vi\u1ec7t \"Chi\" nghi\u0303a la\u0300 ca\u0300nh, trong ca\u0300nh c\u00e2y, ca\u0300nh nh\u00e1nh,l\u00e0 ch\u1eef \"Chi\" trong Kim Chi Ng\u1ecdc Di\u1ec7p \u00fd ch\u1ec9 \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. \u0110\u1eb7t t\u00ean con l\u00e0 \"Ng\u1ecdc Chi\" ba m\u1eb9 mong con s\u1ebd tr\u1edf th\u00e0nh m\u1ed9t c\u00f4 g\u00e1i xinh \u0111\u1eb9p, c\u00f3 ph\u1ea9m ch\u1ea5t cao qu\u00fd.", "sex": 5}
{"first_name": "Nguy\u00ean Chi", "meaning": "Nguy\u00ean Chi l\u00e0 m\u1ed9t c\u00e1i t\u00ean \u0111\u1eb9p \u0111\u1ec3 \u0111\u1eb7t cho con g\u00e1i l\u00e2\u0303n con trai v\u1edbi \u00fd ngh\u0129a con l\u00e0 ng\u01b0\u1eddi hi\u00ea\u0300n ho\u0300a, gi\u00e0u \u0111\u1ee9c h\u1ea1nh & t\u00e2m h\u1ed3n trong s\u00e1ng, nguy\u00ean v\u1eb9n, tr\u00f2n \u0111\u1ea7y.", "sex": 7}
