{"first_name": "Nh\u00e3 Chi", "meaning": "\"Nh\u00e3\" t\u1ee9c nh\u00e3 nh\u1eb7n, \u0111\u1ee9ng \u0111\u1eafn k\u1ebft h\u1ee3p c\u00f9ng ch\u1eef \"Chi\" trong Kim Chi Ng\u1ecdc Di\u1ec7p \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. Nh\u00e3 Chi \u00fd ch\u1ec9 ng\u01b0\u1eddi c\u00f3 cu\u1ed9c s\u1ed1ng an nh\u00e0n, t\u1ef1 t\u1ea1i, t\u00e2m t\u00ednh \u0111i\u1ec1m \u0111\u1ea1m, thu\u1eadn theo l\u1ebd t\u1ef1 nhi\u00ean.", "sex": 5}
{"first_name": "Nh\u1eadt Chi", "meaning": "Nh\u1eadt Chi l\u00e0 danh t\u1eeb ri\u00eang ch\u1ec9 ng\u01b0\u1eddi, l\u00e0 m\u1ed9t c\u00e1i t\u00ean \u0111\u1eb9p th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con trai l\u1eabn con g\u00e1i \u1edf Vi\u00ea\u0323t Nam. Theo ti\u1ebfng H\u00e1n, Nh\u1eadt ngh\u0129a l\u00e0 m\u1eb7t tr\u1eddi; \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i; l\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p, \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. Nh\u1eadt Chi l\u00e0 m\u1eb7t tr\u1eddi d\u1ecbu \u00eam, t\u1ecfa h\u00e0o quang r\u1ef1c r\u1ee1 tr\u00ean m\u1ed9t v\u00f9ng r\u1ed9ng l\u1edbn.", "sex": 7}
{"first_name": "Nh\u01b0 Chi", "meaning": "\"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i; l\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p, \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. \"Nh\u01b0\" trong Nh\u01b0 Y\u0301 nh\u0103\u0300m ch\u1ec9 m\u1ecdi vi\u1ec7c trong cu\u1ed9c s\u1ed1ng c\u1ee7a con s\u1ebd su\u00f4n s\u1ebb\u2026", "sex": 5}
{"first_name": "Ph\u01b0\u1edbc Chi", "meaning": "Ch\u1eef \"Ph\u01b0\u1edbc\" theo ti\u1ebfng H\u00e1n Vi\u00ea\u0323t c\u00f3 hai ngh\u0129a ch\u00ednh nh\u01b0 sau: m\u1ed9t la\u0300 may m\u1eafn, hai l\u00e0 \u0111i\u00ea\u0300u t\u00f4\u0301t la\u0300nh do t\u1ea1o h\u00f3a ban cho ng\u01b0\u01a1\u0300i t\u01b0\u0300ng la\u0300m nhi\u00ea\u0300u vi\u00ea\u0323c nh\u00e2n \u0111\u01b0\u0301c. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i; l\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p, \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. T\u00ean \"Ph\u01b0\u1edbc Chi\" d\u00f9ng \u0111\u1ec3 th\u1ec3 hi\u1ec7n m\u1ed9t con ng\u01b0\u1eddi t\u1ed1t, nh\u00e2n \u0111\u1ee9c n\u00ean lu\u00f4n g\u1eb7p \u0111\u01b0\u1ee3c nh\u1eefng may m\u1eafn, t\u1ed1t l\u00e0nh.", "sex": 5}
{"first_name": "Ph\u01b0\u01a1ng Chi", "meaning": "\"Ph\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m. T\u00ean t\u01b0\u1ee3ng tr\u01b0ng cho m\u1ed9t t\u00e2m h\u1ed3n thanh s\u1ea1ch, thu\u1ea7n khi\u1ebft, h\u1ed3n h\u1eadu, m\u1ed9t v\u1ebb \u0111\u1eb9p ti\u1ec1m \u1ea9n v\u00e0 tinh t\u1ebf c\u1ee7a c\u00e0nh hoa th\u01a1m.", "sex": 5}
