{"first_name": "Thi\u00ean Chi", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, \"Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eddi, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. \"Chi\" trong Kim Chi Ng\u1ecdc Di\u1ec7p \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. T\u1ef1a nh\u01b0 b\u1ea7u tr\u1eddi bao la, ng\u01b0\u1eddi t\u00ean \"Thi\u00ean Chi\" th\u01b0\u1eddng \u0111\u0129nh \u0111\u1ea1c, lu\u00f4n m\u1ea1nh m\u1ebd, c\u00f3 c\u00e1i nh\u00ecn bao qu\u00e1t, t\u1ea7m nh\u00ecn r\u1ed9ng l\u1edbn.", "sex": 5}
{"first_name": "Th\u00fay Chi", "meaning": "Trong ngh\u0129a H\u00e1n Vi\u1ec7t, \"Th\u00fay\" c\u00f3 ngh\u0129a l\u00e0 s\u00e2u s\u1eafc, g\u1ecdn g\u00e0ng, d\u1ee9t kho\u00e1t. Khi s\u00e1nh \u0111\u00f4i c\u00f9ng ch\u1eef \"Chi\" b\u1ed1 m\u1eb9 \u0111\u1eb7t ni\u1ec1m hi v\u1ecdng r\u1eb1ng con g\u00e1i s\u1ebd v\u1eeba xinh \u0111\u1eb9p l\u1ea1i v\u1eeba tinh th\u00f4ng v\u00e0 bi\u1ebft ngh\u0129 s\u00e2u xa, th\u1ea5u \u0111\u00e1o.", "sex": 5}
{"first_name": "Th\u00f9y Chi", "meaning": "Con nh\u01b0 c\u00e0nh l\u00e1 m\u1ec1m m\u1ea1i, d\u1ecbu d\u00e0ng, m\u1ecfng manh", "sex": 5}
{"first_name": "Th\u1ee7y Chi", "meaning": "Th\u1ee7y l\u00e0 b\u1eaft \u0111\u1ea7u. Th\u1ee7y Chi ngh\u0129a l\u00e0 m\u1ea7m l\u00e1 \u0111\u1ea7u ti\u00ean, h\u00e0m ngh\u0129a cha m\u1eb9 mong con c\u00e1i nh\u01b0 \u0111i\u1ec1m h\u1ea1nh ph\u00fac, b\u1eaft \u0111\u1ea7u, kh\u1edfi s\u1ef1 m\u1ecdi \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p.", "sex": 7}
{"first_name": "T\u1ecbnh Chi", "meaning": "Ti\u0323nh- t\u01b0\u0323 thanh ti\u0323nh. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i; l\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p, \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. T\u1ecbnh Chi l\u00e0 s\u1ef1 k\u1ebft h\u1ee3p th\u00fa v\u1ecb \u0111\u1ec3 n\u00f3i v\u1ec1 ng\u01b0\u1eddi t\u0129nh l\u1eb7ng n\u01a1i t\u00e2m h\u1ed3n, \u00fd ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi \u0111\u1ee9c h\u1ea1nh, t\u1ed1t \u0111\u1eb9p, mang l\u1ea1i c\u1ea3m gi\u00e1c vui t\u01b0\u01a1i, hoan h\u1ec9 v\u00e0 nhi\u1ec1u ph\u00fac l\u00e0nh cho nh\u1eefng ng\u01b0\u1eddi xung quanh.", "sex": 5}
{"first_name": "Tr\u00fac Chi", "meaning": "\"Tr\u00fac Chi\" t\u1ee9c nh\u00e0nh tr\u00fac l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a m\u1eabu ng\u01b0\u1eddi qu\u00e2n t\u1eed b\u1edfi lo\u00e0i c\u00e2y n\u00e0y tuy c\u1ee9ng m\u00e0 v\u1eabn m\u1ec1m m\u1ea1i, \u0111\u1ed5 m\u00e0 kh\u00f4ng g\u1eaby. \u0110\u00f3 l\u00e0 h\u00ecnh \u1ea3nh hi\u1ebfm th\u1ea5y gi\u1eefa \u0111\u1ea5t tr\u1eddi. L\u1ea5y h\u00ecnh \u1ea3nh c\u00e2y tr\u00fac \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho con, b\u1ed1 m\u1eb9 hi v\u1ecdng con nh\u01b0 c\u00e2y tr\u00fac l\u00e0 d\u00e1ng c\u00e2y c\u00f3 th\u1ebf tr\u1ef1c th\u1eb3ng \u0111\u1ee9ng, phong c\u00e1ch \u0111\u0129nh \u0111\u1ea1c, c\u00e0nh nh\u00e1nh ngay th\u1eb3ng, g\u1ecdn g\u00e0ng, \u0111\u01b0\u1eddng n\u00e9t d\u1ee9t kho\u00e1t, b\u1ea5t khu\u1ea5t, bi\u1ec3u hi\u1ec7n cho ng\u01b0\u1eddi c\u00f3 k\u1ef7 c\u01b0\u01a1ng nh\u01b0ng l\u1ea1i v\u1eeba xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng.", "sex": 5}
{"first_name": "T\u00fa Chi", "meaning": "T\u00fa trong ngh\u0129a H\u00e1n - Vi\u00ea\u0323t, l\u00e0 ng\u00f4i sao, v\u00ec tinh t\u00fa l\u1ea5p l\u00e1nh chi\u1ebfu s\u00e1ng tr\u00ean cao. C\u00f2n \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i; l\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p, \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. D\u00f9ng t\u00ean \"T\u00fa Chi\" cho con, b\u1ed1 m\u1eb9 ng\u1ea7m \u00fd hi v\u1ecdng con l\u00e0 dung m\u1ea1o xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau.", "sex": 5}
{"first_name": "Tu\u1ec7 Chi", "meaning": "\"Tu\u1ec7\" t\u1ee9c l\u00e0 tr\u00ed tu\u1ec7, s\u1ef1 th\u00f4ng th\u00e1i, hi\u1ec3u bi\u1ebft. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i; l\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p, \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. \"Tu\u1ec7 Chi\" \u00fd ch\u1ec9 mong mu\u1ed1n c\u1ee7a b\u1ed1 m\u1eb9 con l\u00e0 ng\u01b0\u1eddi tinh th\u00f4ng, s\u00e1ng d\u1ea1", "sex": 5}
{"first_name": "T\u01b0\u1eddng Chi", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"T\u01b0\u1eddng\" c\u00f3 ngh\u0129a l\u00e0 tinh t\u01b0\u1eddng, am hi\u1ec3u, bi\u1ebft r\u00f5. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i. T\u00ean \"T\u01b0\u1eddng Chi\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, s\u00e1ng su\u1ed1t, c\u00f3 t\u01b0 duy, c\u00f3 t\u00e0i n\u0103ng. Ngo\u00e0i ra \"T\u01b0\u1eddng\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u00e0nh, m\u1ecdi \u0111i\u1ec1u t\u1ed1t l\u00e0nh, may m\u1eafn s\u1ebd \u0111\u1ebfn v\u1edbi con.", "sex": 5}
{"first_name": "Tuy\u1ebft Chi", "meaning": "\u0110\u00e2y l\u00e0 b\u00ean ph\u1ed5 bi\u1ebfn th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i \u1edf Vi\u00ea\u0323t Nam v\u1edbi \"Tuy\u1ebft\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eafng, tinh kh\u00f4i, \u0111\u1eb9p \u0111\u1ebd. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i; l\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p, \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc", "sex": 5}
{"first_name": "Uy\u00ean Chi", "meaning": "\"Uy\u00ean Chi\" theo ti\u1ebfng H\u00e1n -Vi\u00ea\u0323t, l\u00e0 t\u00ean th\u01b0\u1eddng \u0111\u1eb7t cho ng\u01b0\u1eddi con g\u00e1i, \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i, trong \u0111\u00f3 \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i; l\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p, \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc.", "sex": 5}
{"first_name": "V\u00e2n Chi", "meaning": "\"V\u00e2n\" c\u00f3 ngh\u0129a l\u00e0 m\u00e2y, th\u1ec3 hi\u1ec7n s\u1ef1 nh\u1eb9 nh\u00e0ng, t\u1ef1 do t\u1ef1 t\u1ea1i. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i; l\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p, \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc.", "sex": 5}
{"first_name": "Vi\u1ec7t Chi", "meaning": "Ng\u01b0\u1eddi ta th\u01b0\u1eddng hi\u1ec3u \"Vi\u1ec7t\" l\u00e0 \u00fd ch\u1ec9 v\u00f9ng \u0111\u1ea5t Vi\u1ec7t, ch\u00ednh l\u00e0 Vi\u1ec7t Nam, ngo\u00e0i ra c\u00f2n c\u00f3 ngh\u0129a l\u00e0 \u01b0u vi\u1ec7t, v\u00e0 trong ti\u1ebfng H\u00e1n Vi\u1ec7t \"Chi\" nghi\u0303a la\u0300 ca\u0300nh, trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i. \u0110\u1eb7t t\u00ean \"Vi\u1ec7t Chi\" cho con \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, d\u00f2ng d\u00f5i quy\u1ec1n qu\u00fd, c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc c\u1ee7a \u0111\u1ee9a con \u0111\u1ea5t vi\u1ec7t.", "sex": 5}
{"first_name": "Xu\u00e2n Chi", "meaning": "Xu\u00e2n vi\u1ebft \u0111\u1ea7y \u0111\u1ee7 l\u00e0 m\u00f9a xu\u00e2n: l\u00e0 m\u00f9a c\u1ee7a c\u00e2y c\u1ed1i \u0111\u00e2m ch\u1ed3i, n\u1ea3y l\u1ed9c, sinh s\u00f4i ph\u00e1t tri\u1ec3n. Chi c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. \"Xu\u00e2n Chi\" l\u00e0 t\u00ean th\u01b0\u1eddng d\u00e0nh cho c\u00e1c b\u00e9 g\u00e1i v\u1edbi hi v\u1ecdng con nh\u01b0 m\u00f9a xu\u00e2n r\u1ea1ng ng\u1eddi, mang v\u1ebb \u0111\u1eb9p \u0111a m\u00e0u s\u1eafc v\u00e0 tinh t\u1ebf.", "sex": 5}
