{"first_name": "\u00dd Chi", "meaning": "\u00dd Chi' l\u00e0 m\u1ed9t c\u00e1i t\u00ean th\u01b0\u1eddng \u0111\u1eb7t cho con g\u00e1i. \u00dd c\u00f3 ngh\u0129a l\u00e0 \u0111i\u1ec1u n\u1ea3y ra trong \u0111\u1ea7u \u00f3c m\u1ed7i ng\u01b0\u1eddi khi suy ngh\u0129 (\u00fd t\u1ed1t, \u00fd t\u01b0\u1edfng). \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i; l\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p, \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc.", "sex": 5}
{"first_name": "Y\u00ean Chi", "meaning": "\"Y\u00ean\" l\u00e0 y\u00ean b\u00ecnh, y\u00ean \u1ea3. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i; l\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p \u00fd \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. Ng\u01b0\u1eddi mang t\u00ean \"Y\u00ean Chi\" lu\u00f4n \u0111\u01b0\u1ee3c g\u1eedi g\u1eafm mong mu\u1ed1n c\u00f3 cu\u1ed9c s\u1ed1ng \u00fd ngh\u0129a, y\u00ean b\u00ecnh, t\u1ed1t \u0111\u1eb9p. Trong ti\u1ebfng H\u00e1n, \"Y\u00ean\" c\u0169ng c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u00e0n kh\u00f3i, g\u1ee3i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng, l\u00e3ng \u0111\u00e3ng, phi\u00eau b\u1ed3ng, an nhi\u00ean.", "sex": 5}
{"first_name": "Y\u1ebfn Chi", "meaning": "\"Y\u1ebfn Chi\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u00f4i c\u00e1nh chim y\u1ebfn, ho\u1eb7c ti\u1ebfng h\u00f3t c\u1ee7a chim y\u1ebfn. \u0110\u1eb7t t\u00ean \"Y\u1ebfn Chi\" cho con \u00fd ch\u1ec9 ni\u1ec1m mong \u01b0\u1edbc c\u1ee7a cha m\u1eb9 r\u1eb1ng con s\u1ebd xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau nh\u01b0 lo\u00e0i chim y\u1ebfn.", "sex": 5}
