{"first_name": "Ch\u00ed Vi\u1ec5n", "meaning": "\"Ch\u00ed trong t\u1eeb n\u00f3i \u0111\u1ebfn tinh th\u1ea7n trong t\u1eeb \"\"\u00dd ch\u00ed\"\", Vi\u1ec5n trong t\u1eeb \"\"V\u0129nh vi\u1ec5n\"\". C\u00f3 th\u1ec3 hi\u1ec3u mong mu\u1ed1n c\u1ee7a cha m\u1eb9 sau n\u00e0y con l\u00e0 ng\u01b0\u1eddi c\u00f3 m\u1ed9t \u00fd ch\u00ed ki\u00ean c\u01b0\u1eddng, cao xa v\u00e0 t\u1ea7m nh\u00ecn r\u1ed9ng. Khuy\u00ean con \u0111\u1eebng ng\u1ea1i kh\u00f3 kh\u0103n gian kh\u1ed5 th\u00ec s\u1edbm mu\u1ed9n s\u1ebd th\u00e0nh c\u00f4ng\"", "sex": 3}
