{"first_name": "B\u1ea3o Vinh", "meaning": "B\u1ea3o l\u00e0 s\u1ef1 che ch\u1edf, b\u1ea3o b\u1ecdc, b\u1ea3o v\u1ec7. B\u1ea3o Vinh l\u00e0 ng\u01b0\u1eddi c\u00f3 t\u00ednh h\u01a1i tr\u1ea7m nh\u01b0ng lu\u00f4n l\u00e0 ch\u1ed7 d\u1ef1a v\u1eefng ch\u1eafc cho ng\u01b0\u1eddi th\u00e2n.", "sex": 3}
{"first_name": "B\u1ed5n Vinh", "meaning": "\"Vinh\" t\u1ee9c hi\u1ec3n vinh,vinh d\u1ef1. \"B\u1ed5n\" t\u1ee9c  b\u1ed5n l\u0129nh \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. K\u1ebft h\u1ee3p 2 ch\u1eef n\u00e0y \u0111\u1eb7t cho con, b\u1ed1 m\u1eb9 mong mu\u1ed1n r\u1eb1ng con sau n\u00e0y s\u1ebd c\u00f3 t\u00e0i ngh\u1ec7 h\u01a1n ng\u01b0\u1eddi, ti\u1ebfng vang hi\u1ec3n h\u00e1ch", "sex": 3}
