{"first_name": "Di\u1ec7u Vinh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, t\u00ean \"Vinh\" mang ngh\u0129a gi\u00e0u sang, ph\u00fa qu\u00fd, s\u1ef1 nghi\u1ec7p th\u00e0nh c\u00f4ng vinh hi\u1ec3n, v\u1ebb vang. \"Di\u1ec7u\"c\u00f3 ngh\u0129a l\u00e0 \u0111\u1eb9p, l\u00e0 tuy\u1ec7t di\u1ec7u, \u00fd ch\u1ec9 nh\u1eefng \u0111i\u1ec1u tuy\u1ec7t v\u1eddi \u0111\u01b0\u1ee3c t\u1ea1o n\u00ean b\u1edfi s\u1ef1 kh\u00e9o l\u00e9o, k\u00ec di\u1ec7u. \"Di\u1ec7u Vinh\"l\u00e0 c\u00e1i t\u00ean ng\u1ee5 \u00fd mong mu\u1ed1n con th\u00e0nh c\u00f4ng, vinh quang, t\u01b0\u01a1ng lai r\u1ea1ng ng\u1eddi, con bi\u1ebft tha th\u1ee9 v\u00e0 y\u00eau th\u01b0\u01a1ng.", "sex": 3}
{"first_name": "\u0110\u00ecnh Vinh", "meaning": "\u0110\u00ecnh l\u00e0 c\u1ed9t tr\u1ee5, l\u00e0 trung t\u00e2m.\u0110\u00ecnh Vinh l\u00e0 ng\u01b0\u1eddi quan tr\u1ecdng v\u1edbi ng\u01b0\u1eddi kh\u00e1c, l\u00e0 ng\u01b0\u1eddi bi\u1ebft c\u00e1ch th\u1ec3 hi\u1ec7n b\u1ea3n th\u00e2n v\u1edbi phong \u0111\u1ed9 t\u1ed1t nh\u1ea5t, tr\u1edf th\u00e0nh t\u00e2m \u0111i\u1ec3m c\u1ee7a s\u1ef1 th\u00e0nh c\u00f4ng.", "sex": 3}
{"first_name": "\u0110\u1ee9c Vinh", "meaning": "\u0110\u1ee9c l\u00e0 t\u00ednh t\u1ed1t, h\u1ee3p v\u1edbi \u0111\u1ea1o l\u00ed l\u00e0m ng\u01b0\u1eddi. \u0110\u1ee9c Vinh l\u00e0 ng\u01b0\u1eddi c\u1ee7a c\u1ed9ng \u0111\u1ed3ng, g\u1ea7n g\u0169i v\u00e0 y\u00eau th\u01b0\u01a1ng, lu\u00f4n h\u01b0\u1edbng t\u1edbi s\u1ef1 ch\u00e2n thi\u1ec7n m\u1ef9.", "sex": 3}
{"first_name": "Gia Vinh", "meaning": "T\u00ean \"Vinh\" mang ngh\u0129a gi\u00e0u sang, ph\u00fa qu\u00fd, s\u1ef1 nghi\u1ec7p th\u00e0nh c\u00f4ng vinh hi\u1ec3n, v\u1ebb vang. \"Gia\" trong ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f2n l\u00e0 gia \u0111\u00ecnh, l\u00e0 m\u00e1i nh\u00e0 n\u01a1i m\u1ecdi ng\u01b0\u1eddi sum v\u1ea7y, sinh ho\u1ea1t b\u00ean nhau. Ngo\u00e0i ra ch\u1eef Gia c\u00f2n c\u00f3 ngh\u0129 l\u00e0 xinh \u0111\u1eb9p, \u01b0u t\u00fa, mang ph\u1ea9m ch\u1ea5t cao qu\u00fd. \"Gia Vinh\" mang \u00fd ngh\u0129a l\u00e0 gia \u0111\u00ecnh cao qu\u00fd, c\u00f3 \u0111\u01b0\u1ee3c s\u1ef1 gi\u00e0u sang, ph\u00fa qu\u00fd, th\u00e0nh c\u00f4ng.", "sex": 3}
