{"first_name": "Gi\u1ecfi Vinh", "meaning": "T\u00ean \"Vinh\" mang ngh\u0129a gi\u00e0u sang, ph\u00fa qu\u00fd, s\u1ef1 nghi\u1ec7p th\u00e0nh c\u00f4ng vinh hi\u1ec3n, v\u1ebb vang. \"Gi\u1ecfi\" trong gi\u1ecfi giang, t\u00e0i gi\u1ecfi. \"Gi\u1ecfi Vinh\" d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean th\u1ec3 hi\u1ec7n mong mu\u1ed1n con l\u1edbn l\u00ean s\u1ebd t\u00e0i gi\u1ecfi, c\u00f3 t\u00e0i n\u0103ng, c\u00f3 th\u1ec3 th\u1ef1c hi\u1ec7n \u0111\u01b0\u1ee3c nhi\u1ec1u vi\u1ec7c kh\u00f3 kh\u0103n, v\u00e0 con s\u1ebd c\u00f3 s\u1ef1 nghi\u1ec7p th\u00e0nh c\u00f4ng vinh hi\u1ec3n.", "sex": 3}
