{"first_name": "B\u00edch Vi\u1ec7t", "meaning": "T\u00ean \"Vi\u1ec7t\" xu\u1ea5t ph\u00e1t t\u1eeb t\u00ean c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, c\u0169ng c\u00f3 n\u00e9t ngh\u0129a ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi th\u00f4ng minh, \u01b0u vi\u1ec7t. Ch\u1eef \"B\u00edch\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t lo\u00e0i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng. V\u00ec v\u1eady t\u00ean \"B\u00edch Vi\u1ec7t\" vi\u0301 nh\u01b0 con la\u0300 ho\u0300n ngo\u0323c Vi\u00ea\u0323t s\u00e1ng ng\u1eddi,thu\u00e2\u0300n khi\u00ea\u0301t, la\u0300 ng\u01b0\u1eddi t\u00e0i c\u00e0ng m\u00e0i d\u0169a c\u00e0ng r\u00e8n luy\u1ec7n s\u1ebd c\u00e0ng t\u1ecfa s\u00e1ng", "sex": 5}
{"first_name": "B\u1ed5n Vi\u1ec7t", "meaning": "\"B\u1ed5n Vi\u1ec7t\" l\u00e0 c\u00e1i t\u00ean v\u1eeba hay v\u1eeba \u0111\u1ed9c \u0111\u00e1o \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho c\u00e1c b\u00e9 trai v\u1edbi c\u00e1c \u00fd ngh\u0129a: \"Vi\u1ec7t\" xu\u1ea5t ph\u00e1t t\u1eeb t\u00ean c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, c\u0169ng c\u00f3 n\u00e9t ngh\u0129a ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi th\u00f4ng minh, \u01b0u vi\u1ec7t. Trong khi \u0111\u00f3, \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng", "sex": 3}
{"first_name": "Chi Vi\u1ec7t", "meaning": "Ng\u01b0\u1eddi ta th\u01b0\u1eddng hi\u1ec3u \"Vi\u1ec7t\" l\u00e0 \u00fd ch\u1ec9 v\u00f9ng \u0111\u1ea5t Vi\u1ec7t, ch\u00ednh l\u00e0 Vi\u1ec7t Nam, ngo\u00e0i ra kh\u00f4ng c\u00f2n g\u00ec kh\u00e1c v\u00e0 trong ti\u1ebfng H\u00e1n Vi\u1ec7t \"Chi\" nghi\u0303a la\u0300 ca\u0300nh, trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i. \u0110\u1eb7t t\u00ean \"Chi Vi\u1ec7t\" cho con \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang, d\u00f2ng d\u00f5i quy\u1ec1n qu\u00fd, c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc c\u1ee7a \u0111\u1ee9a con \u0111\u1ea5t vi\u1ec7t.", "sex": 7}
{"first_name": "C\u01b0\u01a1ng Vi\u1ec7t", "meaning": "\"C\u01b0\u01a1ng Vi\u1ec7t\", mong conc\u01b0\u01a1ng ngh\u1ecb, v\u1eefng v\u00e0ng v\u00e0 l\u00e0 ng\u01b0\u1eddi ch\u00ednh tr\u1ef1c.", "sex": 3}
{"first_name": "C\u01b0\u1eddng Vi\u1ec7t", "meaning": "L\u1ef1a ch\u1ecdn t\u00ean \"C\u01b0\u1eddng Vi\u1ec7t\" cho con, b\u1ed1 m\u1eb9 mong mu\u1ed1n con m\u00ecnh s\u1ebd mang v\u1ebb \u0111\u1eb9p ng\u01b0\u1eddi nam nhi \u0111\u1ea5t Vi\u1ec7t:  kh\u1ecfe m\u1ea1nh, c\u00f3 s\u1ee9c l\u1ef1c, c\u1ee9ng c\u1ecfi, kh\u00f4ng d\u1ec5 b\u1ecb khu\u1ea5t ph\u1ee5c. Con s\u1ebd l\u00e0 anh t\u00e0i c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc Vi\u1ec7t Nam m\u00ecnh.", "sex": 3}
{"first_name": "\u0110\u1ee9c Vi\u1ec7t", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\u0110\u1ee9c\" t\u1ee9c l\u00e0 ph\u1ea9m h\u1ea1nh, t\u00e1c phong t\u1ed1t \u0111\u1eb9p, quy ph\u1ea1m m\u00e0 con ng\u01b0\u1eddi ph\u1ea3i tu\u00e2n theo, ch\u1ec9 chung nh\u1eefng vi\u1ec7c t\u1ed1t l\u00e0nh l\u1ea5y \u0111\u1ea1o \u0111\u1ec3 l\u1eadp th\u00e2n. \"Vi\u1ec7t\" l\u00e0 th\u00f4ng minh, \u01b0u vi\u1ec7t. \"\u0110\u1ee9c Vi\u1ec7t\" ngh\u0129a l\u00e0 cha m\u1eb9 mong con tr\u1edf th\u00e0nh ng\u01b0\u1eddi t\u00e0i \u0111\u1ee9c, v\u1eeba c\u00f3 ph\u1ea9m h\u1ea1nh t\u1ed1t \u0111\u1eb9p, v\u1eeba c\u00f3 tr\u00ed tu\u1ec7 th\u00f4ng minh, \u01b0u vi\u1ec7t.", "sex": 3}
{"first_name": "D\u0169ng Vi\u1ec7t", "meaning": "\"D\u0169ng Vi\u1ec7t\", mong con d\u0169ng c\u1ea3m v\u00e0 th\u00e0nh \u0111\u1ea1t, th\u00f4ng minh v\u00e0 v\u1eefng ch\u1eafc.", "sex": 3}
{"first_name": "Duy Vi\u1ec7t", "meaning": "\"Duy\" trong ti\u1ebfng h\u00e1n vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u01b0 duy, suy ngh\u0129 th\u1ea5u \u0111\u00e1o. \"Vi\u1ec7t\" l\u00e0 th\u00f4ng minh, \u01b0u vi\u1ec7t. \"Duy Vi\u1ec7t\" ngh\u0129a l\u00e0 cha m\u1eb9 mong con l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, \u01b0u vi\u1ec7t, bi\u1ebft b\u00ecnh t\u0129nh gi\u1ea3i quy\u1ebft v\u1ea5n \u0111\u1ec1 kh\u00f4ng b\u1ed9p ch\u1ed9p h\u00e0nh x\u1eed, c\u00f3 tr\u00ed tu\u1ec7, th\u00f4ng minh & tinh t\u01b0\u1eddng", "sex": 3}
{"first_name": "Gia Vi\u1ec7t", "meaning": "Gia theo ti\u1ebfng H\u00e1n - Vi\u1ec7t  l\u00e0 lo\u00e0i c\u1ecf lau, mang l\u1ea1i \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p, ph\u00fac l\u00e0nh. \"Gia\" trong ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f2n l\u00e0 gia \u0111\u00ecnh, l\u00e0 m\u00e1i nh\u00e0 n\u01a1i m\u1ecdi ng\u01b0\u1eddi sum v\u1ea7y, sinh ho\u1ea1t b\u00ean nhau. Ngo\u00e0i ra ch\u1eef Gia c\u00f2n c\u00f3 ngh\u0129 l\u00e0 xinh \u0111\u1eb9p, \u01b0u t\u00fa, mang ph\u1ea9m ch\u1ea5t cao qu\u00fd . \"Vi\u1ec7t\" xu\u1ea5t ph\u00e1t t\u1eeb t\u00ean c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, c\u0169ng c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh \u01b0u vi\u1ec7t. \"Gia Vi\u1ec7t\" ngh\u0129a l\u00e0 ng\u01b0\u1eddi con c\u1ee7a gia \u0111\u00ecnh Vi\u1ec7t Nam, \u01b0u t\u00fa, ph\u00fac l\u00e0nh, th\u00f4ng minh, tr\u00ed tu\u1ec7 \u01b0u vi\u1ec7t.", "sex": 3}
{"first_name": "Giang Vi\u1ec7t", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Vi\u1ec7t\" xu\u1ea5t ph\u00e1t t\u1eeb t\u00ean c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, c\u0169ng c\u00f3 n\u00e9t ngh\u0129a ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi th\u00f4ng minh, \u01b0u vi\u1ec7t, \"Giang\" l\u00e0 d\u00f2ng s\u00f4ng, th\u01b0\u1eddng ch\u1ec9 nh\u1eefng \u0111i\u1ec1u cao c\u1ea3, l\u1edbn lao. Ng\u01b0\u1eddi ta th\u01b0\u1eddng l\u1ea5y t\u00ean \"Giang\" \u0111\u1eb7t t\u00ean v\u00ec th\u01b0\u1eddng th\u00edch nh\u1eefng h\u00ecnh \u1ea3nh con s\u00f4ng v\u1eeba \u00eam \u0111\u1ec1m, v\u1eeba m\u1ea1nh m\u1ebd nh\u01b0 cu\u1ed9c \u0111\u1eddi con ng\u01b0\u1eddi c\u00f3 l\u00fac th\u0103ng c\u00f3 l\u00fac tr\u1ea7m. \"Giang Vi\u1ec7t\", con l\u00e0 ng\u01b0\u1eddi c\u00f3 tr\u00ed th\u00f4ng minh \u01b0u vi\u1ec7t h\u01a1n ng\u01b0\u1eddi, lu\u00f4n l\u00e0m \u0111\u01b0\u1ee3c nh\u1eefng vi\u1ec7c l\u1edbn lao phi th\u01b0\u1eddng, m\u1ecdi th\u1eed th\u00e1ch kh\u00f3 kh\u0103n trong cu\u1ed9c s\u1ed1ng con lu\u00f4n bi\u1ebft c\u00e1ch v\u01b0\u1ee3t qua \u0111em l\u1ea1i s\u1ef1 b\u00ecnh y\u00eau \u00e2m \u1ea3 cho gia \u0111\u00ecnh.", "sex": 3}
