{"first_name": "H\u1ea3i Vi\u1ec7t", "meaning": "Theo ngh\u0129a H\u00e1n, \"h\u1ea3i\" c\u00f3 ngh\u0129a l\u00e0 bi\u1ec3n, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. T\u00ean \"H\u1ea3i\" th\u01b0\u1eddng g\u1ee3i h\u00ecnh \u1ea3nh m\u00eanh m\u00f4ng c\u1ee7a bi\u1ec3n c\u1ea3, m\u1ed9t c\u1ea3nh thi\u00ean nhi\u00ean kh\u00e1 quen thu\u1ed9c v\u1edbi cu\u1ed9c s\u1ed1ng con ng\u01b0\u1eddi. \"Vi\u1ec7t\" xu\u1ea5t ph\u00e1t t\u1eeb t\u00ean c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, c\u0169ng c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, \u01b0u vi\u1ec7t. T\u00ean \"H\u1ea3i Vi\u1ec7t\" ngh\u0129a l\u00e0 bi\u1ec3n kh\u01a1i c\u1ee7a Vi\u1ec7t Nam. Con l\u00e0 ng\u01b0\u1eddi kho\u00e1ng \u0111\u1ea1t, t\u1ef1 do, t\u1ea5m l\u00f2ng r\u1ed9ng m\u1edf, c\u00f3 tr\u00ed tu\u1ec7 th\u00f4ng minh \u01b0u vi\u1ec7t.", "sex": 3}
{"first_name": "H\u00f2a Vi\u1ec7t", "meaning": "\"H\u00f2a\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 \u00eam \u1ea5m, y\u00ean \u1ed5n ch\u1ec9 s\u1ef1 thu\u1eadn h\u1ee3p. T\u00ean \"H\u00f2a\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 v\u1ec1 \u0111\u1ee9c t\u00ednh con ng\u01b0\u1eddi, hi\u1ec1n l\u00e0nh, th\u00e1i \u0111\u1ed9 t\u1eeb t\u1ed1n, m\u1ec1m m\u1ecfng, ng\u00f4n ng\u1eef nh\u1ecf nh\u1eb9, \u00f4n h\u00f2a. \"Vi\u1ec7t\" xu\u1ea5t ph\u00e1t t\u1eeb t\u00ean \u0111\u1ea5t n\u01b0\u1edbc, c\u0169ng c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh \u01b0u vi\u1ec7t. \"H\u00f2a Vi\u1ec7t\" c\u00f3 ngh\u0129a con l\u00e0 ng\u01b0\u1eddi hi\u1ec1n l\u00e0nh, t\u1eeb t\u1ed1n, \u00f4n h\u00f2a, c\u00f3 tr\u00ed tu\u1ec7 th\u00f4ng minh, \u01b0u vi\u1ec7t.", "sex": 3}
