{"first_name": "H\u01b0\u01a1ng Vi\u1ec7t", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Vi\u1ec7t\" xu\u1ea5t ph\u00e1t t\u1eeb t\u00ean c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, c\u0169ng c\u00f3 n\u00e9t ngh\u0129a ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi th\u00f4ng minh, \u01b0u vi\u1ec7t. \"H\u01b0\u01a1ng\" c\u00f3 hai \u00fd ngh\u0129a v\u1eeba ch\u1ec9 l\u00e0 qu\u00ea nh\u00e0, l\u00e0 n\u01a1i ch\u1ed1n x\u01b0a; v\u1eeba ch\u1ec9 m\u00f9i h\u01b0\u01a1ng th\u01a1m. \"H\u01b0\u01a1ng Vi\u1ec7t\", con ch\u00ednh l\u00e0 h\u01b0\u01a1ng v\u1ecb qu\u00ea nh\u00e0, v\u1eeba mang n\u00e9t \u0111\u1eb9p c\u1ee7a ng\u01b0\u1eddi Vi\u1ec7t Nam, qu\u00ea h\u01b0\u01a1ng Vi\u1ec7t Nam.", "sex": 5}
