{"first_name": "Kh\u1ea3i Vi\u1ec7t", "meaning": "\"Kh\u1ea3i\" trong H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 vui m\u1eebng, h\u00e2n hoan. T\u00ean \"Kh\u1ea3i\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi vui v\u1ebb, ho\u1ea1t b\u00e1t, n\u0103ng \u0111\u1ed9ng, li\u1ec1n tay li\u1ec1n ch\u00e2n nh\u01b0 \u0111o\u00e0n qu\u00e2n v\u1eeba th\u1eafng tr\u1eadn tr\u1edf v\u1ec1 ca l\u00ean nh\u1eefng kh\u00fac ca vui nh\u1ed9n khi\u1ebfn m\u1ecdi ng\u01b0\u1eddi xung quanh c\u0169ng h\u00f2a theo nh\u1ecbp m\u00faa h\u00e1t  r\u1ed9n r\u00e0ng. \"Vi\u1ec7t\" xu\u1ea5t ph\u00e1t t\u1eeb t\u00ean c\u00f9a \u0111\u1ea5t n\u01b0\u1edbc, c\u0169ng c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh \u01b0u vi\u1ec7t. \"Kh\u1ea3i Vi\u1ec7t\" ngh\u0129a l\u00e0 con ng\u01b0\u1eddi vui v\u1ebb, ho\u1ea1t b\u00e1t, n\u0103ng \u0111\u1ed9ng, th\u00f4ng minh, lanh l\u1ee3i, c\u00f3 tr\u00ed tu\u1ec7 \u01b0u vi\u1ec7t, s\u1ebd g\u1eb7t h\u00e1i th\u00e0nh c\u00f4ng trong cu\u1ed9c s\u1ed1ng.", "sex": 3}
