{"first_name": "Kh\u00f4i Vi\u1ec7t", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Vi\u1ec7t\" xu\u1ea5t ph\u00e1t t\u1eeb t\u00ean c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, c\u0169ng c\u00f3 n\u00e9t ngh\u0129a ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi th\u00f4ng minh, \u01b0u vi\u1ec7t. \"Kh\u00f4i\" \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi t\u00e0i n\u0103ng b\u1eadc nh\u1ea5t, l\u00e0 ng\u01b0\u1eddi gi\u1ecfi \u0111\u1ee9ng \u0111\u1ea7u trong s\u1ed1 nh\u1eefng ng\u01b0\u1eddi gi\u1ecfi, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 m\u1ed9t th\u1ee9 \u0111\u00e1 \u0111\u1eb9p, qu\u00fd gi\u00e1.\"Kh\u00f4i Vi\u1ec7t\" h\u00e0m \u00fd mong mu\u1ed1n con th\u00e0nh c\u00f4ng gi\u1ecfi giang h\u01a1n m\u1ee9c b\u00ecnh th\u01b0\u01a1ng, t\u00e0i n\u0103ng c\u1ee7a con ph\u1ea3i h\u01a1n ng\u01b0\u1eddi xu\u1ea5t ch\u00fang \u01b0u vi\u1ec7t.", "sex": 3}
{"first_name": "L\u00e2m Vi\u1ec7t", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"L\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 r\u1eebng, m\u1ed9t ngu\u1ed3n t\u00e0i nguy\u00ean qu\u00fd c\u00f3 gi\u00e1 tr\u1ecb to l\u1edbn v\u1edbi \u0111\u1eddi s\u1ed1ng. T\u1ef1a nh\u01b0 t\u00ednh ch\u1ea5t c\u1ee7a r\u1eebng, t\u00ean \"L\u00e2m\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi b\u00ecnh d\u1ecb, d\u1ec5 g\u1ea7n nh\u01b0 l\u1ebd t\u1ef1 nhi\u00ean nh\u01b0ng c\u0169ng m\u1ea1nh m\u1ebd & \u0111\u1ea7y uy l\u1ef1c. \"L\u00e2m Vi\u1ec7t\" ngh\u0129a l\u00e0 con ng\u01b0\u1eddi b\u00ecnh d\u1ecb, m\u1ed9c m\u1ea1c nh\u01b0ng c\u0169ng l\u00e0 ng\u01b0\u1eddi m\u1ea1nh m\u1ebd, \u0111\u1ea7y uy l\u1ef1c, th\u00f4ng minh, tr\u00ed tu\u1ec7 \u01b0u vi\u1ec7t", "sex": 3}
{"first_name": "Long Vi\u1ec7t", "meaning": "\"Long\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 con r\u1ed3ng, bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a s\u1ef1 oai v\u1ec7, uy nghi\u00eam, linh thi\u00eang, t\u01b0\u1ee3ng tr\u01b0ng cho b\u1eadc vua ch\u00faa \u0111\u1ea7y quy\u1ec1n l\u1ef1c. \"Vi\u1ec7t\" xu\u1ea5t ph\u00e1t t\u1eeb t\u00ean c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, nh\u01b0ng c\u0169ng c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh \u01b0u vi\u1ec7t. T\u00ean \"Long Vi\u1ec7t\" \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi t\u00e0i gi\u1ecfi phi th\u01b0\u1eddng, phong c\u00e1ch c\u1ee7a b\u1eadc tr\u1ecb v\u00ec, c\u1ed1t c\u00e1ch cao sang, tr\u00ed tu\u1ec7 tinh anh, \u01b0u vi\u1ec7t, l\u00e0 \"con r\u1ed3ng c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc\"", "sex": 3}
{"first_name": "Mai Vi\u1ec7t", "meaning": "\"Mai\" l\u00e0 t\u00ean lo\u00e0i hoa n\u1edf v\u00e0o m\u00f9a xu\u00e2n, b\u00e1o hi\u1ec7u ni\u1ec1m vui & tr\u00e0n \u0111\u1ea7y hy v\u1ecdng. \"Vi\u1ec7t\" c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, \u01b0u vi\u1ec7t. \"Mai Vi\u1ec7t\" ngh\u0129a l\u00e0 xinh \u0111\u1eb9p, tr\u1ebb trung, t\u01b0\u01a1i t\u1eafn, th\u00f4ng minh v\u00e0 \u01b0u vi\u1ec7t.", "sex": 5}
{"first_name": "M\u1ea1nh Vi\u1ec7t", "meaning": "\"M\u1ea1nh\" trong t\u1eeb \u0111i\u1ec3n Vi\u1ec7t \u0111\u01b0\u1ee3c d\u1ecbch l\u00e0 kh\u1ecfe kho\u1eafn, m\u1ea1nh m\u1ebd, t\u1eeb ch\u1ec9 v\u1ec1 v\u00f3c d\u00e1ng & s\u1ee9c l\u1ef1c c\u1ee7a con ng\u01b0\u1eddi. \"Vi\u1ec7t\" l\u00e0 th\u00f4ng minh \u01b0u vi\u1ec7t. T\u00ean \"M\u1ea1nh Vi\u1ec7t\" c\u00f3 ngh\u0129a cha m\u1eb9 mong con v\u1eeba tr\u1edf th\u00e0nh ng\u01b0\u1eddi kh\u1ecfe m\u1ea1nh, s\u1ee9c kh\u1ecfe t\u1ed1t \u00edt b\u1ec7nh t\u1eadt, s\u1ed1ng m\u1ea1nh m\u1ebd, ki\u00ean c\u01b0\u1eddng, v\u1eeba c\u00f3 tr\u00ed tu\u1ec7 th\u00f4ng minh, \u01b0u vi\u1ec7t", "sex": 3}
{"first_name": "Minh Vi\u1ec7t", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, Minh c\u00f2n c\u00f3 ngh\u0129a ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (b\u00ecnh minh) th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. \"Vi\u1ec7t\" xu\u1ea5t ph\u00e1t t\u1eeb t\u00ean c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, c\u0169ng c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh \u01b0u vi\u1ec7t. \u0110\u1eb7t t\u00ean \"Minh Vi\u1ec7t\" c\u00f3 ngh\u0129a mong mu\u1ed1n con l\u00e0 nh\u1eefng m\u1ea7n non t\u01b0\u01a1ng lai c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, th\u00f4ng minh, t\u00e0i tr\u00ed, \u01b0u vi\u1ec7t", "sex": 3}
{"first_name": "My Vi\u1ec7t", "meaning": "\"My\" c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p,  \u0111\u00e1ng y\u00eau. \"Vi\u1ec7t\" l\u00e0 \u01b0u vi\u1ec7t, xu\u1ea5t ch\u00fang. \"My Vi\u1ec7t\" ngh\u0129a l\u00e0 con xinh \u0111\u1eb9p h\u01a1n ng\u01b0\u1eddi v\u00e0 c\u00f3 tr\u00ed tu\u1ec7 xu\u1ea5t ch\u00fang.", "sex": 5}
{"first_name": "Nam Vi\u1ec7t", "meaning": "Nam l\u00e0 ng\u01b0\u1eddi con trai, l\u00e0 nam t\u1eed h\u00e1n. Nam Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ng\u01b0\u1eddi con trai t\u00e0i gi\u1ecfi, c\u00f3 t\u00e0i n\u0103ng xu\u1ea5t ch\u00fang, \u01b0u vi\u1ec7t, v\u01b0\u1ee3t tr\u1ed9i h\u01a1n ng\u01b0\u1eddi", "sex": 3}
{"first_name": "Nh\u1eadt Vi\u1ec7t", "meaning": "\"Nh\u1eadt Vi\u1ec7t\" ngh\u0129a l\u00e0 m\u1eb7t tr\u1eddi n\u01b0\u1edbc Vi\u1ec7t, t\u00ean n\u00e0y th\u1ec3 hi\u1ec7n ni\u1ec1m t\u1ef1 h\u00e0o d\u00e2n t\u1ed9c m\u1ea1nh m\u1ebd, ba m\u1eb9 mong mu\u1ed1n con sau n\u00e0y c\u0169ng s\u1ebd chi\u1ebfu s\u00e1ng gi\u1ecfi giang nh\u01b0 \u00e1nh m\u1eb7t tr\u1eddi.", "sex": 3}
