{"first_name": "Ph\u00fac Vi\u1ec7t", "meaning": "Ch\u1eef  \"Ph\u00fac\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 ch\u1ec9 nh\u1eefng s\u1ef1 t\u1ed1t l\u00e0nh (g\u1ed3m c\u00f3: gi\u00e0u sang, y\u00ean l\u00e0nh, s\u1ed1ng l\u00e2u, c\u00f3 \u0111\u1ee9c t\u1ed1t, vui h\u1ebft tu\u1ed5i tr\u1eddi), gi\u00e0u sang, may m\u1eafn. \"Vi\u1ec7t\" l\u00e0 th\u00f4ng minh \u01b0u vi\u1ec7t. T\u00ean \"Ph\u00fac Vi\u1ec7t\" v\u1eeba th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 ph\u1ea9m ch\u1ea5t t\u1ed1t, lu\u00f4n g\u1eb7p may m\u1eafn, c\u00f3 nhi\u1ec1u c\u01a1 h\u1ed9i t\u1ed1t trong cu\u1ed9c s\u1ed1ng, th\u01b0\u1eddng \u0111\u01b0\u1ee3c qu\u00fd nh\u00e2n gi\u00fap, v\u1eeba l\u00e0 ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7 th\u00f4ng minh, \u01b0u vi\u1ec7t", "sex": 3}
{"first_name": "Quang Vi\u1ec7t", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, Quang c\u00f3 ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, t\u00ean Quang d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, s\u00e1ng su\u1ed1t, c\u00f3 t\u00e0i n\u0103ng. \"Vi\u1ec7t\" xu\u1ea5t ph\u00e1t t\u1eeb t\u00ean c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, c\u0169ng c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, \u01b0u vi\u1ec7t. T\u00ean \"Quang Vi\u1ec7t\" l\u00e0 mong mu\u1ed1n c\u1ee7a ba m\u1eb9 mu\u1ed1n con m\u00ecnh l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, hi\u1ec3u bi\u1ebft v\u00e0 th\u00e0nh c\u00f4ng, l\u00e0 nh\u00e2n t\u00e0i c\u1ee7a \u0111\u1ea5t Vi\u1ec7t", "sex": 3}
{"first_name": "Qu\u1ebf Vi\u1ec7t", "meaning": "\"Vi\u1ec7t\" l\u00e0 d\u00e2n t\u1ed9c Vi\u1ec7t. \"Qu\u1ebf Vi\u1ec7t\" ngh\u0129a l\u00e0 c\u00e2y qu\u1ebf \u0111\u1ea5t Vi\u1ec7t, ch\u1ec9 v\u00e0o ng\u01b0\u1eddi con g\u00e1i trung ch\u00ednh hi\u1ec1n l\u01b0\u01a1ng, th\u00f9y m\u1ecb k\u00edn \u0111\u00e1o", "sex": 5}
