{"first_name": "T\u00e0i Vi\u1ec7t", "meaning": "\"Vi\u1ec7t\" l\u00e0 v\u01b0\u1ee3t. \"T\u00e0i Vi\u1ec7t\" l\u00e0 ng\u01b0\u1eddi gi\u00fap cho k\u1ebb kh\u00e1c v\u01b0\u1ee3t tr\u1ed9i t\u00e0i n\u0103ng", "sex": 3}
{"first_name": "T\u1ea5n Vi\u1ec7t", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"T\u1ea5n\" v\u1eeba c\u00f3 ngh\u0129a l\u00e0 h\u1ecfi th\u0103m, th\u1ec3 hi\u1ec7n s\u1ef1 quan t\u00e2m, \u00e2n c\u1ea7n, v\u1eeba c\u00f3 ngh\u0129a l\u00e0 ti\u1ebfn l\u00ean, th\u1ec3 hi\u1ec7n s\u1ef1 ph\u00e1t tri\u1ec3n, th\u0103ng ti\u1ebfn. Vi\u1ec7t l\u00e0 th\u00f4ng minh \u01b0u vi\u1ec7t. T\u00ean \"T\u1ea5n Vi\u1ec7t\" th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi th\u00e2n thi\u1ec7n, h\u00f2a \u0111\u1ed3ng, quan t\u00e2m t\u1edbi ng\u01b0\u1eddi kh\u00e1c, v\u1eeba l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh, \u01b0u vi\u1ec7t, c\u00f3 ti\u1ec1n \u0111\u1ed3, s\u1ef1 nghi\u1ec7p th\u0103ng ti\u1ebfn, v\u1eefng m\u1ea1nh", "sex": 3}
