{"first_name": "Tr\u00ed Vi\u1ec7t", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Tr\u00ed\" l\u00e0 tr\u00ed kh\u00f4n, tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft. T\u00ean \"Tr\u00ed\" l\u00e0 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, tr\u00ed tu\u1ec7, t\u00e0i gi\u1ecfi. \"Tr\u00ed Vi\u1ec7t\" ngh\u0129a l\u00e0 cha m\u1eb9 mong con l\u00e0 \u0111\u1ee9a con c\u00f3 tri th\u1ee9c, th\u1ea5u hi\u1ec3u \u0111\u1ea1o l\u00fd l\u00e0m ng\u01b0\u1eddi, t\u01b0\u01a1ng lai t\u01b0\u01a1i s\u00e1ng, l\u00e0 nh\u00e2n t\u00e0i c\u1ee7a n\u01b0\u1edbc Vi\u1ec7t Nam, th\u00f4ng minh, \u01b0u vi\u1ec7t", "sex": 3}
{"first_name": "Trinh Vi\u1ec7t", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Vi\u1ec7t\" c\u00f3 ngh\u0129a l\u00e0 b\u00f3ng r\u1ee3p c\u1ee7a c\u00e2y, \u00fd n\u00f3i \u0111\u1ebfn b\u00f3ng m\u00e1t, \u0111\u01b0\u1ee3c ch\u1edf che, bao b\u1ecdc, \"Trinh\" c\u00f3 ngh\u0129a l\u00e0 ti\u1ebft h\u1ea1nh, th\u1ee7y chung. T\u00ean \"Trinh Vi\u1ec7t\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, c\u00f4ng dung ng\u00f4n h\u1ea1nh, th\u1ee7y chung, son s\u1eafc, ngay th\u1eb3ng, kh\u1eb3ng kh\u00e1i, lu\u00f4n \u0111\u01b0\u1ee3c y\u00eau th\u01b0\u01a1ng, bao b\u1ecdc, g\u1eb7p nhi\u1ec1u \u0111i\u1ec1u t\u1ed1t l\u00e0nh", "sex": 5}
{"first_name": "Trung Vi\u1ec7t", "meaning": "Trung l\u00e0 l\u00f2ng trung th\u00e0nh, kh\u00f4ng thay l\u00f2ng \u0111\u1ed5i d\u1ea1. Trung Vi\u1ec7t th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t t\u00ean  cho ng\u01b0\u1eddi con trai v\u1edbi mong mu\u1ed1n lu\u00f4n gi\u1eef \u0111\u01b0\u1ee3c s\u1ef1 ki\u00ean trung b\u1ea5t \u0111\u1ecbnh, \u00fd ch\u00ed s\u1eaft \u0111\u00e1, m\u1ea1nh m\u1ebd, l\u00e0m n\u00ean vi\u1ec7c l\u1edbn", "sex": 3}
{"first_name": "Tu\u1ea5n Vi\u1ec7t", "meaning": "\"Tu\u1ea5n\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, t\u00e0i tr\u00ed v\u01b0\u1ee3t b\u1eadc. V\u00ec v\u1eady t\u00ean n\u00e0y \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ch\u00e0ng trai c\u00f3 di\u1ec7n m\u1ea1o tu\u1ea5n t\u00fa, \u0111a t\u00e0i, t\u1ea1o \u0111\u01b0\u1ee3c \u1ea5n t\u01b0\u1ee3ng v\u00e0 thi\u1ec7n c\u1ea3m v\u1edbi nh\u1eefng ng\u01b0\u1eddi xung quanh. \"Vi\u1ec7t\" xu\u1ea5t ph\u00e1t t\u1eeb t\u00ean c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, c\u0169ng c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh \u01b0u vi\u1ec7t. \"Tu\u1ea5n Vi\u1ec7t\" l\u00e0 con ng\u01b0\u1eddi t\u00e0i gi\u1ecfi c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, di\u1ec7n m\u1ea1o tu\u1ea5n t\u00fa, \u0111a t\u00e0i, tr\u00ed tu\u1ec7 th\u00f4ng minh, \u01b0u vi\u00eat.", "sex": 3}
{"first_name": "Uy Vi\u1ec7t", "meaning": "Ch\u1eef  \"Vi\u1ec7t\" xu\u1ea5t ph\u00e1t t\u1eeb t\u00ean c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, c\u0169ng c\u00f3 n\u00e9t ngh\u0129a ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi th\u00f4ng minh, \u01b0u vi\u1ec7t. K\u1ebft h\u1ee3p v\u1edbi \"Uy\" l\u00e0 quy\u1ec1n uy, \"Uy Vi\u1ec7t\" th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd.", "sex": 3}
