{"first_name": "\u0110\u0103ng Khoa", "meaning": "C\u00e1i t\u00ean v\u1edbi ni\u1ec1m tin v\u1ec1 t\u00e0i n\u0103ng, h\u1ecdc v\u1ea5n v\u00e0 khoa b\u1ea3ng c\u1ee7a con trong t\u01b0\u01a1ng lai", "sex": 3}
{"first_name": "\u00d0\u0103ng Khoa", "meaning": "H\u00e3y thi c\u1eed \u0111\u1ed7 \u0111\u1ea1t \u0111\u1ec3 l\u00e0m r\u1ea1ng danh gia t\u1ed9c con nh\u00e9", "sex": 3}
{"first_name": "Danh Khoa", "meaning": "\"Danh\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 \u0111\u1ea7y \u0111\u1ee7, ng\u1ee5 \u00fd con ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng kho\u00e1ng \u0111\u1ea1t, r\u1ed9ng r\u00e3i. Danh Khoa \u00fd n\u00f3i ng\u01b0\u1eddi c\u00f3 t\u00e0i n\u0103ng, \u0111\u1ee9c \u0111\u1ed9, h\u1ecdc r\u1ed9ng, c\u00f3 ch\u00ed v\u01b0\u01a1n xa, s\u1edbm th\u00e0nh c\u00f4ng trong t\u01b0\u01a1ng lai", "sex": 3}
{"first_name": "Di Khoa", "meaning": "\"Di\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 vui v\u1ebb, sung s\u01b0\u1edbng. Di Khoa \u00fd cha m\u1eb9 mong mu\u1ed1n con ph\u00e1t tri\u1ec3n ti\u1ec1n t\u00e0i, danh v\u1ecdng, c\u00f3 m\u1ed9t cu\u1ed9c s\u1ed1ng sung t\u00fac, vui v\u1ebb", "sex": 3}
{"first_name": "\u0110i\u1ec1m Khoa", "meaning": "\"\u0110i\u1ec1m\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 m\u1eadt ng\u1ecdt, v\u1ecb ng\u1ecdt, h\u00e0m ngh\u0129a s\u1ef1 t\u1ed1t \u0111\u1eb9p. \u0110i\u1ec1m Khoa \u00fd cha m\u1eb9 mu\u1ed1n con c\u00e1i sau n\u00e0y th\u00e0nh t\u00e0i s\u1ebd c\u00f3 m\u1ed9t cu\u1ed9c s\u1ed1ng t\u1ed1t \u0111\u1eb9p, \u0111\u1ea7y \u0111\u1ee7, t\u01b0\u01a1m t\u1ea5t", "sex": 3}
{"first_name": "\u0110\u00ednh Khoa", "meaning": "\"\u0110\u00ednh\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 g\u1eafn k\u1ebft, bi\u1ec3u hi\u1ec7n s\u1ef1 an \u0111\u1ecbnh, v\u1eefng v\u00e0ng, m\u1ea1nh m\u1ebd. \u0110\u00ednh Khoa \u00fd n\u00f3i ng\u01b0\u1eddi t\u00e0i cao h\u1ecdc r\u1ed9ng, c\u00f3 \u0111\u1ecba v\u1ecb trong x\u00e3 h\u1ed9i, cu\u1ed9c s\u1ed1ng kh\u00e1 gi\u1ea3, \u1ed5n \u0111\u1ecbnh", "sex": 3}
{"first_name": "\u0110\u00ecnh Khoa", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"\u0110\u00ecnh\" ngh\u0129a l\u00e0 tr\u00fac nh\u1ecf ho\u1eb7c c\u00e0nh c\u00e2y nh\u1ecf,m\u1eb7t kh\u00e1c \"\u00d0\u00ecnh\" c\u0169ng c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ed7 \u0111\u1ea1t, th\u00e0nh c\u00f4ng tr\u00ean con \u0111\u01b0\u1eddng h\u1ecdc v\u1eabn.\"Khoa\" th\u01b0\u1eddng mang h\u00e0m \u00fd t\u1ed1t \u0111\u1eb9p, ch\u1ec9 s\u1ef1 vi\u1ec7c to l\u1edbn, d\u00f9ng \u0111\u1ec3 n\u00f3i v\u1ec1 ng\u01b0\u1eddi c\u00f3 \u0111\u1ecba v\u1ecb x\u00e3 h\u1ed9i & tr\u00ecnh \u0111\u1ed9 h\u1ecdc v\u1ea5n. Theo v\u0103n h\u00f3a c\u1ee7a ng\u01b0\u1eddi x\u01b0a, c\u00e1c \u0111\u1ea5ng nam nhi th\u01b0\u1eddng l\u1ea5y c\u00f4ng danh \u0111\u1ed7 \u0111\u1ea1t l\u00e0m tr\u1ecdng n\u00ean t\u00ean \"Khoa\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 mong mu\u1ed1n con c\u00e1i sau n\u00e0y t\u00e0i n\u0103ng, th\u00f4ng minh, ham h\u1ecdc h\u1ecfi, s\u1edbm \u0111\u1ed7 \u0111\u1ea1t th\u00e0nh danh.\"\u0110\u00ecnh Khoa\"mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh t\u00e0i gi\u1ecfi th\u00e0nh \u0111\u1ea1t trong cu\u1ed9c s\u1ed1ng, v\u00e0 c\u00f3 t\u01b0\u01a1ng lai \u1ed5n \u0111\u1ecbnh v\u1eefng ch\u1eafc.", "sex": 3}
{"first_name": "\u0110\u1ecbnh Khoa", "meaning": "\"\u0110\u1ecbnh\" l\u00e0 s\u1ef1 ki\u00ean \u0111\u1ecbnh, kh\u00f4ng \u0111\u1ed5i d\u1eddi, b\u1ea5t bi\u1ebfn. \u0110\u1ecbnh Khoa \u00fd n\u00f3i l\u00e0 ng\u01b0\u1eddi t\u00e0i c\u00f3 s\u1ef1 chung th\u1ee7y, m\u1ed9t l\u00f2ng m\u1ed9t d\u1ea1, mu\u1ed1n c\u1ed1ng hi\u1ebfn ph\u00e1t tri\u1ec3n n\u01a1i m\u00e0 m\u00ecnh l\u1eadp nghi\u1ec7p", "sex": 3}
{"first_name": "\u0110\u1ed9 Khoa", "meaning": "\"\u0110\u1ed9\" h\u00e0m ngh\u0129a s\u1ef1 bao dung, ch\u00ednh x\u00e1c. \u0110\u1ed9 Khoa \u00fd n\u00f3i ng\u01b0\u1eddi c\u00f3 t\u00e0i n\u0103ng, gi\u1ecfi giang, lu\u00f4n bi\u1ebft gi\u00fap \u0111\u1ee1 m\u1ecdi ng\u01b0\u1eddi xung quanh", "sex": 3}
{"first_name": "\u0110oan Khoa", "meaning": "\"\u0110oan\" \u00fd ch\u1ec9 ngay th\u1eb3ng, ch\u00ednh tr\u1ef1c, hi\u1ec1n th\u1ee5c, \u0111oan trang. \u0110oan Khoa \u00fd n\u00f3i ng\u01b0\u1eddi t\u00e0i cao h\u1ecdc r\u1ed9ng nh\u01b0ng kh\u00f4ng ba hoa, lu\u00f4n nhu m\u00ec, khi\u00eam nh\u01b0\u1eddng, c\u00f3 ch\u00ed h\u01b0\u1edbng c\u1ea7u ti\u1ebfn cao", "sex": 5}
{"first_name": "\u0110o\u00e0n Khoa", "meaning": "\"\u0110o\u00e0n\" trong ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 tr\u00f2n, \u0111\u1ea7y, v\u1eeba v\u1eb7n. \u0110o\u00e0n Khoa \u00fd n\u00f3i ng\u01b0\u1eddi lu\u00f4n bi\u1ebft ph\u1ea5n \u0111\u1ea5u, l\u01b0\u1ee3m l\u1eb7t nh\u1eefng \u0111i\u1ec1u m\u1edbi l\u1ea1, ki\u1ebfn th\u1ee9c trong cu\u1ed9c s\u1ed1ng, \u0111\u1ec3 t\u00edch g\u00f3p ph\u00e1t tri\u1ec3n b\u1ea3n th\u00e2n, s\u1ef1 nghi\u1ec7p", "sex": 3}
{"first_name": "\u0110\u00f4ng Khoa", "meaning": "\"\u0110\u00f4ng\" ch\u1ec9 ng\u01b0\u1eddi t\u1ec9nh t\u00e1o, th\u00e1i \u0111\u1ed9 b\u00ecnh t\u0129nh, s\u00e2u s\u1eafc. \u0110\u00f4ng Khoa \u00fd n\u00f3i ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, c\u00f3 t\u1ea7m nh\u00ecn, lu\u00f4n suy x\u00e9t m\u1ecdi vi\u1ec7c c\u00f3 t\u00ednh t\u01b0 duy, ch\u1eafc ch\u1eafn, khoa h\u1ecdc", "sex": 3}
{"first_name": "\u0110\u1ee9c Khoa", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \" \u0110\u1ee9c\"  t\u1ee9c l\u00e0 ph\u1ea9m h\u1ea1nh, t\u00e1c phong t\u1ed1t \u0111\u1eb9p, quy ph\u1ea1m m\u00e0 con ng\u01b0\u1eddi ph\u1ea3i tu\u00e2n theo, ch\u1ec9 chung nh\u1eefng vi\u1ec7c t\u1ed1t l\u00e0nh l\u1ea5y \u0111\u1ea1o \u0111\u1ec3 l\u1eadp th\u00e2n.\"Khoa\" th\u01b0\u1eddng mang h\u00e0m \u00fd t\u1ed1t \u0111\u1eb9p, ch\u1ec9 s\u1ef1 vi\u1ec7c to l\u1edbn, d\u00f9ng \u0111\u1ec3 n\u00f3i v\u1ec1 ng\u01b0\u1eddi c\u00f3 \u0111\u1ecba v\u1ecb x\u00e3 h\u1ed9i & tr\u00ecnh \u0111\u1ed9 h\u1ecdc v\u1ea5n. Theo v\u0103n h\u00f3a c\u1ee7a ng\u01b0\u1eddi x\u01b0a, c\u00e1c \u0111\u1ea5ng nam nhi th\u01b0\u1eddng l\u1ea5y c\u00f4ng danh \u0111\u1ed7 \u0111\u1ea1t l\u00e0m tr\u1ecdng n\u00ean t\u00ean \"Khoa\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 mong mu\u1ed1n con c\u00e1i sau n\u00e0y t\u00e0i n\u0103ng, th\u00f4ng minh, ham h\u1ecdc h\u1ecfi, s\u1edbm \u0111\u1ed7 \u0111\u1ea1t th\u00e0nh danh.\"\u0110\u1ee9c Khoa\"mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh t\u00e0i gi\u1ecfi v\u00e0 l\u00e0 ng\u01b0\u1eddi t\u00e0i \u0111\u1ee9c v\u1eb9n to\u00e0n.", "sex": 3}
{"first_name": "D\u0169ng Khoa", "meaning": "\"D\u0169ng\" c\u00f3 ngh\u0129a l\u00e0 s\u1ee9c m\u1ea1nh, can \u0111\u1ea3m ng\u01b0\u1eddi c\u00f3 kh\u00ed ph\u00e1ch, d\u0169ng kh\u00ed. D\u0169ng Khoa \u00fd ch\u1ec9 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi lu\u00f4n \u0111i \u0111\u1ea7u, ham h\u1ecdc h\u1ecfi, th\u00e0nh t\u00e0i, \u0111\u1ed7 \u0111\u1ea1t trong t\u01b0\u01a1ng lai", "sex": 3}
{"first_name": "D\u01b0\u01a1ng Khoa", "meaning": "\"D\u01b0\u01a1ng\" trong Th\u00e1i D\u01b0\u01a1ng hay c\u00f2n g\u1ecdi l\u00e0 m\u1eb7t tr\u1eddi, \u00fd ch\u1ec9 lu\u00f4n r\u1ea1ng ng\u1eddi, chi\u1ebfu s\u00e1ng. D\u01b0\u01a1ng Khoa \u00fd ch\u1ec9 ng\u01b0\u1eddi t\u00e0i n\u0103ng, gi\u1ecfi giang, \u0111a t\u00e0i, th\u00e0nh danh, mang l\u1ea1i c\u00f4ng danh v\u1ebb vang", "sex": 3}
{"first_name": "Duy Khoa", "meaning": "\"Duy\" trong ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u01b0 duy, suy ngh\u0129 th\u1ea5u \u0111\u00e1o. Duy Khoa \u00fd ch\u1ec9 ng\u01b0\u1eddi t\u00e0i c\u00f3 t\u1ea7m nh\u00ecn xa tr\u00f4ng r\u1ed9ng, ki\u1ebfn th\u1ee9c uy\u00ean th\u00e2m, l\u00e0 ng\u01b0\u1eddi c\u00f3 \u0111\u1ecba v\u1ecb cao trong x\u00e3 h\u1ed9i", "sex": 3}
{"first_name": "Gia Khoa", "meaning": "\"Gia\" ngh\u0129a l\u00e0 \u0111i\u1ec3m t\u1ef1a, ch\u1eafc ch\u1eafn, an to\u00e0n. Gia Khoa \u00fd mu\u1ed1n n\u00f3i m\u1ed9t nam nh\u00e2n gi\u1ecfi giang, \u0111a t\u00e0i, th\u00f4ng minh, l\u00e0 tr\u1ee5 c\u1ed9t v\u1eefng ch\u1eafc cho ng\u01b0\u1eddi th\u00e2n, gia \u0111\u00ecnh", "sex": 3}
{"first_name": "H\u1ea3i Khoa", "meaning": "\"H\u1ea3i\" \u00fd ch\u1ec9 s\u1ef1 kho\u00e1ng \u0111\u1ea1t, t\u1ef1 do, t\u1ea5m l\u00f2ng r\u1ed9ng m\u1edf nh\u01b0 h\u00ecnh \u1ea3nh c\u1ee7a bi\u1ec3n kh\u01a1i. H\u1ea3i Khoa \u00fd n\u00f3i ng\u01b0\u1eddi t\u00e0i lu\u00f4n kh\u00f4ng ng\u1eebng h\u1ecdc h\u1ecfi, kh\u00f4ng ng\u1eebng n\u1ed7 l\u1ef1c, ph\u1ea5n \u0111\u1ea5u", "sex": 3}
{"first_name": "H\u1ea1nh Khoa", "meaning": "\"H\u1ea1nh\" c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 ph\u00fac l\u1ed9c, l\u00e0 ph\u01b0\u1edbc l\u00e0nh. H\u1ea1nh Khoa \u00fd n\u00f3i mong mu\u1ed1n con c\u00e1i sau n\u00e0y gi\u1ecfi giang, lu\u00f4n may m\u1eafn, th\u00e0nh c\u00f4ng tr\u00ean con \u0111\u01b0\u1eddng s\u1ef1 nghi\u1ec7p", "sex": 5}
{"first_name": "Hi\u1ebfu Khoa", "meaning": "T\u00ean \"Hi\u1ebfu Khoa\" \u00fd n\u00f3i cha m\u1eb9 mong mu\u1ed1n con c\u00e1i ghi nh\u1edb \u0111\u1ea1o \u0111\u1ee9c, h\u1ecdc nh\u00e2n c\u00e1ch l\u00e0m ng\u01b0\u1eddi. H\u1ecdc \u0111i \u0111\u00f4i v\u1edbi h\u00e0nh, l\u00e0 ng\u01b0\u1eddi v\u0103n v\u00f5 song to\u00e0n, bi\u1ebft tr\u01b0\u1edbc bi\u1ebft sau", "sex": 7}
{"first_name": "Ho\u00e0i Khoa", "meaning": "\"Ho\u00e0i\" ngh\u0129a l\u00e0 t\u1ea5m l\u00f2ng, l\u00e0 t\u00e2m t\u00ednh, t\u00ecnh \u00fd b\u00ean trong con ng\u01b0\u1eddi. Ho\u00e0i Khoa \u00fd n\u00f3i ng\u01b0\u1eddi h\u1ecdc r\u1ed9ng, t\u00e0i cao, d\u00f9 gi\u1ecfi th\u1ebf n\u00e0o c\u0169ng ph\u1ea3i khi\u00eam nh\u01b0\u1eddng, bi\u1ebft k\u00ednh tr\u00ean nh\u01b0\u1eddng d\u01b0\u1edbi, nh\u1edb v\u1ec1 c\u1ed9i ngu\u1ed3n", "sex": 7}
