{"first_name": "Di\u1ec7p Xuy\u1ebfn", "meaning": "Theo ti\u1ebfng H\u00e1n- Vi\u1ec7t l\u00e0 ch\u1eef \"Di\u1ec7p\" ch\u00ednh l\u00e0 \"l\u00e1\" trong Kim Chi Ng\u1ecdc Di\u1ec7p (d\u1ecbch l\u00e0 c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc). \"Xuy\u1ebfn\" l\u00e0 m\u00f3n trang s\u1ee9c qu\u00fd gi\u00e1. V\u00ec v\u1eady, \u0111\u1eb7t t\u00ean \"Di\u1ec7p Xuy\u1ebfn\" cho con ng\u1ee5  \u00fd mu\u1ed1n n\u00f3i con l\u00e0 b\u1ea3o v\u1eadt qu\u00fd c\u1ee7a gia \u0111\u00ecnh, l\u00e0 con nh\u00e0 quy\u1ec1n qu\u00fd sang gi\u00e0u, d\u00f2ng d\u00f5i danh gi\u00e1. B\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n th\u1ec3 hi\u1ec7n mong mu\u1ed1n t\u1ed1t \u0111\u1eb9p c\u1ee7a b\u1ed1 m\u1eb9 \u0111\u1ec3 con m\u00ecnh lu\u00f4n ki\u00eau sa, qu\u00fd ph\u00e1i khi \u0111\u01b0\u1ee3c \u0111\u1eb7t t\u00ean n\u00e0y.", "sex": 5}
{"first_name": "H\u1ea3i Xuy\u1ebfn", "meaning": "Theo ngh\u0129a H\u00e1n, \"H\u1ea3i\" c\u00f3 ngh\u0129a l\u00e0 bi\u1ec3n, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. T\u00ean \"H\u1ea3i\" th\u01b0\u1eddng g\u1ee3i h\u00ecnh \u1ea3nh m\u00eanh m\u00f4ng c\u1ee7a bi\u1ec3n c\u1ea3, m\u1ed9t c\u1ea3nh thi\u00ean nhi\u00ean kh\u00e1 quen thu\u1ed9c v\u1edbi cu\u1ed9c s\u1ed1ng con ng\u01b0\u1eddi. K\u1ebft h\u1ee3p v\u1edbi \"Xuy\u1ebfn\" ngh\u0129a l\u00e0 m\u00f3n trang s\u1ee9c qu\u00fd gi\u00e1. T\u00ean \"H\u1ea3i Xuy\u1ebfn\" th\u1ec3 hi\u1ec7n s\u1ef1  kho\u00e1ng \u0111\u1ea1t, t\u1ef1 do, mong mu\u1ed1n con c\u00f3 t\u1ea5m l\u00f2ng r\u1ed9ng m\u1edf nh\u01b0 h\u00ecnh \u1ea3nh c\u1ee7a bi\u1ec3n kh\u01a1i v\u00e0 con lu\u00f4n l\u00e0 b\u1ea3o v\u1eadt qu\u00fd gi\u00e1 c\u1ee7a cha m\u1eb9.", "sex": 5}
