{"first_name": "Ph\u01b0\u01a1ng Xuy\u1ebfn", "meaning": "Ch\u1eef  \"Ph\u01b0\u01a1ng\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t ngh\u0129a l\u00e0 h\u01b0\u1edbng, v\u1ecb tr\u00ed, \u0111\u1ea1o l\u00fd. T\u00ean \"Ph\u01b0\u01a1ng\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi bi\u1ebft \u0111\u1ea1o l\u00fd l\u00e0m ng\u01b0\u1eddi, bi\u1ebft ph\u00e2n bi\u1ec7t t\u1ed1t x\u1ea5u, \u0111\u00fang sai. Th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi s\u00e1ng su\u1ed1t, tr\u00ed tu\u1ec7. T\u00ean  \"Ph\u01b0\u01a1ng\" l\u00e0 mong mu\u1ed1n c\u1ee7a cha m\u1eb9 mu\u1ed1n con m\u00ecnh lu\u00f4n l\u00e0m nh\u1eefng \u0111i\u1ec1u t\u1ed1t, bi\u1ebft c\u00e1ch \u0111\u1ed1i nh\u00e2n x\u1eed th\u1ebf, l\u00e0m cha m\u1eb9 y\u00ean l\u00f2ng. K\u1ebft h\u1ee3p v\u1edbi \"Xuy\u1ebfn\" ngh\u0129a l\u00e0 m\u00f3n trang s\u1ee9c \u0111\u1eb9p, qu\u00fd gi\u00e1. \"Ph\u01b0\u01a1ng Xuy\u1ebfn\"- con l\u00e0 b\u1ea3o v\u1eadt qu\u00fd gi\u00e1 c\u1ee7a ba m\u1eb9, mong con l\u00e0 ng\u01b0\u1eddi s\u00e1ng su\u1ed1t, tr\u00ed tu\u1ec7, bi\u1ebft \u0111\u1ea1o l\u00fd.", "sex": 5}
