{"first_name": "Th\u01b0 Xuy\u1ebfn", "meaning": "\"Th\u01b0\" l\u00e0 \u00e1m ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i d\u1ec5 th\u01b0\u01a1ng, xinh \u0111\u1eb9p, \u0111oan trang, c\u00f3 t\u00e2m h\u1ed3n trong s\u00e1ng, r\u1ea5t bao dung v\u00e0 nh\u00e2n h\u1eadu. \"Xuy\u1ebfn\" trong ti\u1ebfng H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 v\u00f2ng trang s\u1ee9c b\u1eb1ng v\u00e0ng, th\u1ec3 hi\u1ec7n s\u1ef1 qu\u00fd gi\u00e1, cao sang, tinh x\u1ea3o, \u0111\u1eb9p \u0111\u1ebd.  \u0110\u1eb7t t\u00ean con \"Th\u01b0 Xuy\u1ebfn\" ngh\u0129a l\u00e0 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p \u0111oan trang, \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi y\u00eau m\u1ebfn, tr\u00e2n tr\u1ecdng, qu\u00fd gi\u00e1.", "sex": 5}
{"first_name": "Th\u1ee5y Xuy\u1ebfn", "meaning": "Theo ti\u1ebfng H\u00e1n, \"Th\u1ee5y\" l\u00e0 t\u00ean chung c\u1ee7a ng\u1ecdc khu\u00ea ng\u1ecdc b\u00edch, \u0111\u1eddi x\u01b0a d\u00f9ng ng\u1ecdc \u0111\u1ec3 l\u00e0m tin. T\u00ean \"Th\u1ee5y\" th\u1ec3 hi\u1ec7n \u0111\u01b0\u1ee3c s\u1ef1 thanh cao, qu\u00fd ph\u00e1i. Ngo\u00e0i ra, \"Th\u1ee5y\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 \u0111i\u1ec1m l\u00e0nh, mong mu\u1ed1n cu\u1ed9c s\u1ed1ng b\u00ecnh an, may m\u1eafn, g\u1eb7p \u0111\u01b0\u1ee3c nhi\u1ec1u \u0111i\u1ec1u t\u1ed1t l\u00e0nh. \"Xuy\u1ebfn\" l\u00e0 m\u00f3n \u0111\u1ed3 trang s\u1ee9c qu\u00fd gi\u00e1. \"Th\u1ee5y Xuy\u1ebfn\" l\u00e0 mong mu\u1ed1n con s\u1ebd xinh \u0111\u1eb9p, sang tr\u1ecdng, c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac, vinh hoa.", "sex": 5}
{"first_name": "Ti\u1ec3u Xuy\u1ebfn", "meaning": "Ti\u1ec3u c\u00f3 ngh\u0129a l\u00e0 nh\u1ecf b\u00e9, xinh x\u1eafn \u0111\u00e1ng y\u00eau c\u00f2n Xuy\u1ebfn l\u00e0 m\u00f3n trang s\u1ee9c b\u1eb1ng v\u00e0ng qu\u00fd gi\u00e1. T\u00ean Ti\u1ec3u Xuy\u1ebfn mang \u00fd ngh\u0129a con b\u00e9 nh\u1ecf, \u0111\u00e1ng y\u00eau & l\u00e0 c\u1ee7a ca\u0309i qu\u00fd b\u00e1u c\u1ee7a gia \u0111\u00ecnh.", "sex": 5}
{"first_name": "Tr\u00e0 Xuy\u1ebfn", "meaning": "\"Tr\u00e0\" l\u00e0 lo\u1ea1i c\u00e2y xanh l\u01b0u ni\u00ean m\u1ecdc th\u00e0nh b\u1ee5i ho\u1eb7c c\u00e1c c\u00e2y nh\u1ecf, \u0111\u01b0\u1ee3c tr\u1ed3ng \u0111\u1ec3 l\u1ea5y l\u00e1, n\u1ea5u n\u01b0\u1edbc v\u00ec m\u00f9i th\u01a1m \u0111\u1eb7c tr\u01b0ng c\u1ee7a m\u00ecnh. \"Tr\u00e0\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean g\u1ee3i \u0111\u1ebfn s\u1ef1 g\u1ea7n g\u0169i, th\u00e2n y\u00eau. \" Xuy\u1ebfn\" l\u00e0 m\u00f3n trang s\u1ee9c qu\u00fd gi\u00e1. T\u00ean \"Tr\u00e0 Xuy\u1ebfn\" mang \u00fd ngh\u0129a con l\u00e0 b\u1ea3o v\u1eadt qu\u00fd c\u1ee7a gia \u0111\u00ecnh, cha m\u1eb9 mong con xinh \u0111\u1eb9p, m\u1ed9c m\u1ea1c, c\u00f3 s\u1ee9c s\u1ed1ng m\u1ea1nh m\u1ebd, l\u00e0m \u0111\u01b0\u1ee3c nhi\u1ec1u vi\u1ec7c c\u00f3 \u00edch gi\u00fap ng\u01b0\u1eddi, gi\u00fap \u0111\u1eddi.", "sex": 5}
