{"first_name": "An Kh\u01b0\u01a1ng", "meaning": "N\u1ebfu gh\u00e9p c\u00e1c b\u1ed9 ch\u1eef trong ti\u1ebfng H\u00e1n th\u00ec Kh\u01b0\u01a1ng c\u00f3 ngh\u0129a chi\u1ebft l\u1ecdc t\u1eeb c\u00e1c b\u1ed9 D\u01b0\u01a1ng l\u00e0 kh\u1ecfe, nhanh nh\u1eb9n nh\u01b0 con s\u01a1n d\u01b0\u01a1ng tr\u00ean n\u00fai, kh\u00f3 kh\u0103n, v\u1ea5t v\u1ea3, kh\u1ed5 s\u1edf \u0111\u1ebfn \u0111\u00e2u c\u0169ng v\u1eabn s\u1ed1ng, v\u1eabn t\u1ed3n t\u1ea1i v\u00e0 ph\u00e1t tri\u1ec3n v\u00e0 t\u1eeb b\u1ed9 V\u01b0\u01a1ng ngh\u0129a l\u00e0 vua, \u00fd ch\u1ec9 g\u01b0\u1eddi c\u00f3 quy\u1ec1n l\u1ef1c. \u0110\u1eb7t t\u00ean n\u00e0y cho con, b\u1ed1 m\u1eb9 hi v\u1ecdng con l\u00e0 ng\u01b0\u1eddi c\u00f3 kh\u00ed ti\u1ebft lu\u00f4n v\u1eefng v\u00e0ng tr\u01b0\u1edbc m\u1ecdi phong ba b\u00e3o t\u00e1p; c\u00f3 s\u1ed1 m\u1ec7nh may m\u1eafn, tr\u00e1nh \u0111\u01b0\u1ee3c m\u1ecdi tr\u1eafc tr\u1edf trong cu\u1ed9c s\u1ed1ng", "sex": 5}
{"first_name": "B\u1ea3o Kh\u01b0\u01a1ng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"B\u1ea3o\" th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. \"Kh\u01b0\u01a1ng\" mang \u00fd ngh\u0129a nh\u01b0 ch\u1ec9 s\u1ef1 y\u00ean \u1ed5n, an b\u00ecnh ho\u1eb7c \u0111\u01b0\u1ee3c d\u00f9ng khi n\u00f3i \u0111\u1ebfn s\u1ef1 gi\u00e0u c\u00f3, \u0111\u1ee7 \u0111\u1ea7y.\"B\u1ea3o Kh\u01b0\u01a1ng\" -Con s\u1ebd l\u00e0 b\u1ea3o b\u1ed1i b\u00e1u v\u1eadt c\u1ee7a ba m\u1eb9.", "sex": 3}
