{"first_name": "K\u1ef3 Kh\u01b0\u01a1ng", "meaning": "Theo ngh\u0129a  H\u00e1n - Vi\u1ec7t \"K\u1ef3\" c\u00f3 th\u1ec3 hi\u1ec3u th\u00e0nh nhi\u1ec1u ngh\u0129a nh\u01b0 l\u00e1 c\u1edd, qu\u00e2n c\u1edd\u2026 tuy nhi\u00ean khi d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean, \"K\u1ef3\" l\u1ea1i mang \u00fd ngh\u0129a r\u1ea5t t\u1ed1t \u0111\u1eb9p. \"Kh\u01b0\u01a1ng\" mang \u00fd ngh\u0129a nh\u01b0 ch\u1ec9 s\u1ef1 y\u00ean \u1ed5n, an b\u00ecnh ho\u1eb7c \u0111\u01b0\u1ee3c d\u00f9ng khi n\u00f3i \u0111\u1ebfn s\u1ef1 gi\u00e0u c\u00f3, \u0111\u1ee7 \u0111\u1ea7y.\u0110\u1eb7t t\u00ean con trai l\u00e0 \"K\u1ef3 Kh\u01b0\u01a1ng\", ba m\u1eb9 mong con gi\u1ecfi giang, c\u00f3 t\u00e0i n\u0103ng v\u00e0 s\u1ef1 m\u1ea1nh m\u1ebd \u0111\u1ec3 g\u00e1nh v\u00e1c nh\u1eefng tr\u1ecdng tr\u00e1ch l\u1edbn lao.", "sex": 3}
