{"first_name": "\u0110\u00ecnh Gi\u1ecfi", "meaning": "\u0110\u00ecnh trong ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 c\u1ed9t, l\u00e0 x\u00e0 ch\u1ed1ng \u0111\u1ee1. T\u00ean \u0110\u00ecnh th\u1ec3 hi\u1ec7n s\u1ef1 m\u1ea1nh m\u1ebd, v\u1eefng ch\u1eafc \u00fd ch\u1ec9 con l\u00e0 ng\u01b0\u1eddi m\u1ecdi ng\u01b0\u1eddi c\u00f3 th\u1ec3 tr\u00f4ng c\u1eady. \u0110\u00ecnh trong H\u00e1n vi\u1ec7t c\u00f2n c\u00f3 ngh\u0129a l\u00e0 \u1ed5n th\u1ecfa, th\u00f2a \u0111\u00e1ng th\u1ec3 hi\u1ec7n s\u1ef1 s\u1eafp x\u1ebfp \u00eam \u1ea5m. \"Gi\u1ecfi\" trong gi\u1ecfi giang, t\u00e0i gi\u1ecfi. T\u00ean \"\u0110\u00ecnh Gi\u1ecfi\" th\u1ec3 hi\u1ec7n mong mu\u1ed1n con l\u1edbn l\u00ean s\u1ebd t\u00e0i gi\u1ecfi, c\u00f3 th\u1ec3 th\u1ef1c hi\u1ec7n \u0111\u01b0\u1ee3c nhi\u1ec1u vi\u1ec7c kh\u00f3 kh\u0103n, l\u00e0 tr\u1ee5 c\u1ed9t v\u1eefng ch\u1eafc, m\u1ea1nh m\u1ebd v\u00e0 \u0111\u00e1ng tin c\u1eady c\u1ee7a gia \u0111\u00ecnh.", "sex": 3}
{"first_name": "Hi\u1ec1n Gi\u1ecfi", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, khi n\u00f3i v\u1ec1 ng\u01b0\u1eddi th\u00ec \"Hi\u1ec1n\" c\u00f3 ngh\u0129a l\u00e0 t\u1ed1t l\u00e0nh, c\u00f3 t\u00e0i c\u00f3 \u0111\u1ee9c. T\u00ean \"Hi\u1ec1n\" ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 t\u00ednh \u00f4n h\u00f2a, \u0111\u1eb1m th\u1eafm, d\u00e1ng v\u1ebb, c\u1eed ch\u1ec9 nh\u1eb9 nh\u00e0ng, th\u00e2n thi\u1ec7n, c\u00f3 t\u00e0i n\u0103ng & \u0111\u1ee9c h\u1ea1nh.", "sex": 5}
