{"first_name": "Kim Gi\u1ecfi", "meaning": "\"Kim\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ti\u1ec1n, l\u00e0 v\u00e0ng. T\u00ean \"Kim\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c cha m\u1eb9 \u0111\u1eb7t v\u1edbi h\u00e0m \u00fd mong mu\u1ed1n cu\u1ed9c s\u1ed1ng sung t\u00fac, ph\u00fa qu\u00fd v\u1eefng b\u1ec1n, ki\u00ean c\u1ed1 d\u00e0nh cho con c\u00e1i. \"Gi\u1ecfi\" trong gi\u1ecfi giang, t\u00e0i gi\u1ecfi. T\u00ean \"Kim Gi\u1ecfi\" th\u1ec3 hi\u1ec7n mong mu\u1ed1n con l\u1edbn l\u00ean s\u1ebd t\u00e0i gi\u1ecfi, c\u00f3 t\u00e0i n\u0103ng, c\u00f3 th\u1ec3 th\u1ef1c hi\u1ec7n \u0111\u01b0\u1ee3c nhi\u1ec1u vi\u1ec7c kh\u00f3 kh\u0103n, v\u00e0 con s\u1ebd c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac, ph\u00fa qu\u00fd v\u1eefng b\u1ec1n.", "sex": 5}
