{"first_name": "Thanh Gi\u1ecfi", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 m\u00e0u xanh, tu\u1ed5i tr\u1ebb, c\u00f2n l\u00e0 s\u1ef1 thanh cao, trong s\u1ea1ch, thanh b\u1ea1ch. Ng\u01b0\u1eddi t\u00ean \"Thanh\" th\u01b0\u1eddng c\u00f3 kh\u00ed ch\u1ea5t \u0111i\u1ec1m \u0111\u1ea1m, nh\u1eb9 nh\u00e0ng v\u00e0 cao qu\u00fd. \"Gi\u1ecfi\" trong gi\u1ecfi giang, t\u00e0i gi\u1ecfi. T\u00ean \"Thanh Gi\u1ecfi\" th\u1ec3 hi\u1ec7n mong mu\u1ed1n con l\u1edbn l\u00ean s\u1ebd l\u00e0 ng\u01b0\u1eddi v\u1eeba t\u00e0i gi\u1ecfi, v\u1eeba c\u00f3 kh\u00ed ch\u1ea5t thanh cao, trong s\u1ea1ch.", "sex": 5}
