{"first_name": "T\u1ea5n V\u01b0\u1ee3ng", "meaning": "\"T\u1ea5n\" c\u00f3 ngh\u0129a l\u00e0 nhanh, ch\u00f3ng, t\u0103ng v\u00f9n v\u1ee5t. T\u1ea5n V\u01b0\u1ee3ng mong mu\u1ed1n con c\u00f3 cu\u1ed9c s\u1ed1ng gi\u00e0u sang ph\u00fa qu\u00fd 1 c\u00e1ch nhanh ch\u00f3ng v\u00e0 m\u1ea1nh m\u1ebd.", "sex": 3}
{"first_name": "Thanh V\u01b0\u1ee3ng", "meaning": "Thanh ch\u1ec9 ng\u01b0\u1eddi \u0111i\u1ec1m \u0111\u1ea1m thanh cao trong s\u1ea1ch. Thanh V\u01b0\u1ee3ng mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi thanh cao trong s\u1ea1ch c\u00f4ng ch\u00ednh li\u00eam minh v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng gi\u00e0u sang ph\u00fa qu\u00fd lu\u00f4n vui v\u1ebb h\u1ea1nh ph\u00fac", "sex": 3}
{"first_name": "Th\u00e0nh V\u01b0\u1ee3ng", "meaning": "Th\u00e0nh l\u00e0 ho\u00e0n th\u00e0nh, tr\u1ecdn v\u1eb9n, lu\u00f4n l\u00e0m m\u1ecdi vi\u1ec7c \u0111\u01b0\u1ee3c ho\u00e0n h\u1ea3o v\u00e0 th\u00e0nh c\u00f4ng. Th\u00e0nh V\u01b0\u1ee3ng mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi lu\u00f4n chu to\u00e0n m\u1ecdi c\u00f4ng vi\u1ec7c 1 c\u00e1ch ho\u00e0n h\u1ea3o v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng gi\u00e0u sang sung t\u00fac.", "sex": 3}
{"first_name": "Thi\u00ean V\u01b0\u1ee3ng", "meaning": "\"Thi\u00ean\" l\u00e0 b\u1ea7u tr\u1eddi, kh\u00f4ng gian. Thi\u00ean V\u01b0\u1ee3ng mong mu\u1ed1n con c\u00f3 s\u1ef1 gi\u00e0u sang ph\u00fa qu\u00fd to l\u1edbn nh\u01b0 b\u1ea7u tr\u1eddi.", "sex": 3}
{"first_name": "Th\u1ecbnh V\u01b0\u1ee3ng", "meaning": "Th\u1ecbnh l\u00e0 ph\u00e1t \u0111\u1ea1t, y\u00ean vui. Th\u1ecbnh V\u01b0\u1ee3ng l\u00e0 ng\u01b0\u1eddi lu\u00f4n vui v\u1ebb y\u00eau \u0111\u1eddi, gi\u00e0u c\u00f3, th\u00e0nh c\u00f4ng trong cu\u1ed9c s\u1ed1ng v\u00e0 y\u00eau \u0111\u1eddi", "sex": 3}
{"first_name": "Tr\u00ed V\u01b0\u1ee3ng", "meaning": "Tr\u00ed l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh tr\u00ed tu\u1ec7 t\u00e0i gi\u1ecfi.Tr\u00ed V\u01b0\u1ee3ng con l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh v\u00e0 gi\u1ecfi giang cu\u1ed9c s\u1ed1ng c\u1ee7a con lu\u00f4n gi\u00e0u sang sung t\u00fac", "sex": 3}
{"first_name": "Tu\u1ea5n V\u01b0\u1ee3ng", "meaning": "Tu\u1ea5n l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, c\u00f3 t\u00e0i n\u0103ng. Tu\u1ea5n V\u01b0\u1ee3ng th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi c\u00f3 c\u00e1 t\u00ednh, m\u1ea1nh m\u1ebd, c\u00f3 t\u00e0i n\u0103ng v\u00e0 c\u00f3 l\u1eadp tr\u01b0\u1eddng ri\u00eang trong c\u00e1c l\u0129nh v\u1ef1c.", "sex": 3}
{"first_name": "\u00c1i Vy", "meaning": "T\u00ean \"\u00c1i\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. \"\u00c1i\" c\u00f2n \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 n\u00f3i v\u1ec1 ng\u01b0\u1eddi ph\u1ee5 n\u1eef c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, \u0111oan trang. V\u00ec v\u1eady t\u00ean \"\u00c1i\" \u0111\u1eb7t cho con th\u1ec3 hi\u1ec7n dung nhan v\u00e0 ph\u1ea9m h\u1ea1nh n\u1ebft na n\u01a1i con \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng. \"\u00c1i Vy\" l\u00e0 c\u00f4 g\u00e1i nh\u1ecf nh\u1eafn, xinh \u0111\u1eb9p, c\u00f3 ph\u1ea9m h\u1ea1nh v\u00e0 n\u1ebft na, lu\u00f4n \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi qu\u00fd m\u1ebfn.", "sex": 5}
{"first_name": "B\u1ea3o Vy", "meaning": "Ch\u1eef \"B\u1ea3o\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. V\u00ec v\u1eady, t\u00ean \"B\u1ea3o\"th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con nh\u01b0 h\u00e0m \u00fd con ch\u00ednh l\u00e0 b\u1ea3o v\u1eadt m\u00e0 b\u1ed1 m\u1eb9 lu\u00f4n n\u00e2ng niu, gi\u1eef g\u00ecn. B\u00ean c\u1ea1nh, t\u00ean \"B\u1ea3o\" c\u00f2n \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 cu\u1ed9c s\u1ed1ng \u1ea5m \u00eam lu\u00f4n \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng. T\u00ean con l\u00e0\"B\u1ea3o Vy\" ngh\u0129a l\u00e0 1 c\u00f4 g\u00e1i nh\u1ecf nh\u1eafn, xinh x\u1eafn, l\u00e0 b\u1ea3o v\u1eadt c\u1ee7a b\u1ed1 m\u1eb9.", "sex": 5}
{"first_name": "B\u00edch Vy", "meaning": "Ch\u1eef \"B\u00edch\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t lo\u00e0i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng. V\u00ec v\u1eady t\u00ean \"B\u00edch\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 con ng\u01b0\u1eddi v\u1edbi mong mu\u1ed1n m\u1ed9t dung m\u1ea1o xinh \u0111\u1eb9p, s\u00e1ng ng\u1eddi, m\u1ed9t ph\u1ea9m ch\u1ea5t cao qu\u00fd, thanh tao, l\u00e0 ng\u01b0\u1eddi t\u00e0i c\u00e0ng m\u00e0i d\u0169a c\u00e0ng r\u00e8n luy\u1ec7n s\u1ebd c\u00e0ng t\u1ecfa s\u00e1ng. K\u1ebft h\u1ee3p v\u1edbi \"Vy\" ngh\u0129a  l\u00e0 nh\u1ecf nh\u1eafn, xinh \u0111\u1eb9p. \"B\u00edch Vy\" mang \u00fd ngh\u0129a c\u00f4 g\u00e1i nh\u1ecf nh\u1eafn c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, s\u00e1ng ng\u1eddi, t\u1ecfa s\u00e1ng.", "sex": 5}
{"first_name": "C\u1ea9m Vy", "meaning": "\"C\u1ea9m\" l\u00e0 m\u1ed9t lo\u00e0i g\u1ed7 qu\u00fd. \"Vy\" l\u00e0 nh\u1ecf nh\u1eafn xinh x\u1eafn. T\u00ean \"C\u1ea9m Vy\" ngh\u0129a l\u00e0 c\u00f4 g\u00e1i nh\u1ecf nh\u1eafn, xinh x\u1eafn, cao sang, qu\u00fd ph\u00e1i, c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p.", "sex": 5}
{"first_name": "\u0110an Vy", "meaning": "\"\u0110an\" l\u00e0 vi\u00ean linh \u0111an, vi\u00ean ng\u1ecdc qu\u00fd, th\u01b0\u1eddng \u0111\u1eb7t cho con g\u00e1i th\u1ec3 hi\u1ec7n n\u00e9t d\u1ecbu d\u00e0ng, xinh x\u1eafn. \"\u0110an Vy\"-con s\u1ebd l\u00e0 m\u1ed9t c\u00f4 g\u00e1i nh\u1ecf nh\u1eafn, d\u1ecbu d\u00e0ng, d\u1ec5 th\u01b0\u01a1ng.", "sex": 5}
{"first_name": "Di\u1ec7u Vy", "meaning": "\"Di\u1ec7u\" theo ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 \u0111\u1eb9p, l\u00e0 tuy\u1ec7t di\u1ec7u, \u00fd ch\u1ec9 nh\u1eefng \u0111i\u1ec1u tuy\u1ec7t v\u1eddi \u0111\u01b0\u1ee3c t\u1ea1o n\u00ean b\u1edfi s\u1ef1 kh\u00e9o l\u00e9o, k\u00ec di\u1ec7u. T\u00ean \"Di\u1ec7u\" mang l\u1ea1i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0ng v\u1eabn cu\u1ed1n h\u00fat, \u1ea5n t\u01b0\u1ee3ng n\u00ean th\u01b0\u1eddng ph\u00f9 h\u1ee3p \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i. \u0110\u1eb7t t\u00ean con \"Di\u1ec7u Vy\" ngh\u0129a l\u00e0 c\u00f4 g\u00e1i nh\u1ecf nh\u1eafn, d\u1ecbu d\u00e0ng.", "sex": 5}
{"first_name": "Gia Vy", "meaning": "\"Gia\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t  l\u00e0 lo\u00e0i c\u1ecf lau, mang l\u1ea1i \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p, ph\u00fac l\u00e0nh, \"Gia\" trong ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f2n l\u00e0 gia \u0111\u00ecnh, l\u00e0 m\u00e1i nh\u00e0 n\u01a1i m\u1ecdi ng\u01b0\u1eddi sum v\u1ea7y, sinh ho\u1ea1t b\u00ean nhau. Ngo\u00e0i ra ch\u1eef \"Gia\" c\u00f2n c\u00f3 ngh\u0129 l\u00e0 xinh \u0111\u1eb9p, \u01b0u t\u00fa, mang ph\u1ea9m ch\u1ea5t cao qu\u00fd. \"Gia Vy\" l\u00e0 con ng\u01b0\u1eddi \u0111\u1eb9p, lu\u00f4n mang l\u1ea1i \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p, ph\u00fac l\u00e0nh cho gia \u0111\u00ecnh.", "sex": 7}
