{"first_name": "Hi\u1ec1n Vy", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, khi n\u00f3i v\u1ec1 ng\u01b0\u1eddi th\u00ec \"Hi\u1ec1n\" c\u00f3 ngh\u0129a l\u00e0 t\u1ed1t l\u00e0nh, c\u00f3 t\u00e0i c\u00f3 \u0111\u1ee9c. T\u00ean \"Hi\u1ec1n\" ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 t\u00ednh \u00f4n h\u00f2a, \u0111\u1eb1m th\u1eafm, d\u00e1ng v\u1ebb, c\u1eed ch\u1ec9 nh\u1eb9 nh\u00e0ng, th\u00e2n thi\u1ec7n, c\u00f3 t\u00e0i n\u0103ng, \u0111\u1ee9c h\u1ea1nh. \"Hi\u1ec1n Vy\" ngh\u0129a l\u00e0 c\u00f4 g\u00e1i nh\u1ecf nh\u1eafn, xinh \u0111\u1eb9p, t\u00ednh t\u00ecnh \u00f4n h\u00f2a \u0111\u1eb1m th\u1eafm, d\u1ecbu d\u00e0ng, th\u00e2n thi\u1ec7n.", "sex": 5}
{"first_name": "Ho\u00e0i Vy", "meaning": "\"Ho\u00e0i\" c\u00f3 ngh\u0129a l\u00e0 nh\u1edb, l\u00e0 mong ch\u1edd, tr\u00f4ng ng\u00f3ng. \"Vy\" l\u00e0 m\u1ed9t lo\u00e0i hoa, xinh x\u1eafn, nh\u1ecf b\u00e9 \u0111\u1ea7y s\u1ee9c s\u1ed1ng. M\u1eb9 \u0111\u1eb7t t\u00ean con \"Ho\u00e0i Vy\" v\u1edbi mong mu\u1ed1n con s\u1ebd l\u00e0 m\u1ed9t c\u00f4 g\u00e1i xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, g\u1eedi g\u1eafm t\u00e2m t\u01b0 t\u00ecnh c\u1ea3m c\u1ee7a ba m\u1eb9.", "sex": 5}
{"first_name": "Ho\u00e0ng Vy", "meaning": "\"Ho\u00e0ng\" trong ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 m\u00e0u v\u00e0ng, \u00e1nh s\u1eafc c\u1ee7a v\u00e0ng v\u00e0 \u1edf m\u1ed9t ngh\u0129a kh\u00e1c th\u00ec \"Ho\u00e0ng\" th\u1ec3 hi\u1ec7n s\u1ef1 nghi\u00eam trang, r\u1ef1c r\u1ee1,huy ho\u00e0ng nh\u01b0 b\u1eadc vua ch\u00faa. T\u00ean \"Ho\u00e0ng\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi v\u0129 \u0111\u1ea1i, c\u00f3 c\u1ed1t c\u00e1ch v\u01b0\u01a1ng gi\u1ea3, v\u1edbi mong mu\u1ed1n t\u01b0\u01a1ng lai ph\u00fa qu\u00fd, sang gi\u00e0u. M\u1eb9 \u0111\u1eb7t t\u00ean con g\u00e1i l\u00e0 \"Ho\u00e0ng Vy\" mong mu\u1ed1n con l\u00e0 c\u00f4 g\u00e1i xinh \u0111\u1eb9p, r\u1ef1c r\u1ee1, c\u00f3 t\u01b0\u01a1ng lai ph\u00fa qu\u00fd gi\u00e0u sang.", "sex": 5}
{"first_name": "H\u1ed3ng Vy", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"H\u1ed3ng\" l\u00e0 \u00fd ch\u1ec9 m\u00e0u \u0111\u1ecf , m\u00e0 m\u00e0u \u0111\u1ecf v\u1ed1n th\u1ec3 hi\u1ec7n cho ni\u1ec1m vui, s\u1ef1 may m\u1eafn, c\u00e1t t\u01b0\u1eddng. Theo th\u00f3i quen \u0111\u1eb7t t\u00ean c\u1ee7a ng\u01b0\u1eddi Vi\u1ec7t, t\u00ean H\u1ed3ng th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con g\u00e1i v\u00ec \u0111\u00e2y c\u00f2n l\u00e0 t\u00ean m\u1ed9t lo\u1ea1i hoa xinh \u0111\u1eb9p lu\u00f4n ng\u1eddi s\u1eafc h\u01b0\u01a1ng. \u0110\u1eb7t t\u00ean con g\u00e1i \"H\u1ed3ng Vy\" mang \u00fd ngh\u0129a m\u1ed9t lo\u00e0i hoa h\u1ed3ng, nh\u1ecf nh\u1eafn, xinh \u0111\u1eb9p, lu\u00f4n ng\u1eddi s\u1eafc h\u01b0\u01a1ng.", "sex": 5}
{"first_name": "Kh\u00e1nh Vy", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Kh\u00e1nh\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng s\u1ef1 vi\u1ec7c vui m\u1eebng, mang c\u1ea3m gi\u00e1c h\u00e2n hoan, th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 di\u1ec5n t\u1ea3 kh\u00f4ng kh\u00ed trong c\u00e1c bu\u1ed5i ti\u1ec7c, bu\u1ed5i l\u1ec5 \u0103n m\u1eebng. T\u00ean \"Kh\u00e1nh\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi \u0111\u1ee9c h\u1ea1nh, t\u1ed1t \u0111\u1eb9p mang l\u1ea1i c\u1ea3m gi\u00e1c vui t\u01b0\u01a1i, hoan h\u1ec9 cho nh\u1eefng ng\u01b0\u1eddi xung quanh. \"Kh\u00e1nh Vy\"- con s\u1ebd l\u00e0 1 c\u00f4 g\u00e1i xinh \u0111\u1eb9p, vui v\u1ebb, lu\u00f4n mang l\u1ea1i ni\u1ec1m vui cho m\u1ecdi ng\u01b0\u1eddi.", "sex": 5}
{"first_name": "Kim Vy", "meaning": "\"Kim\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ti\u1ec1n, l\u00e0 v\u00e0ng. T\u00ean \"Kim\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c cha m\u1eb9 \u0111\u1eb7t v\u1edbi h\u00e0m \u00fd mong mu\u1ed1n cu\u1ed9c s\u1ed1ng sung t\u00fac, ph\u00fa qu\u00fd v\u1eefng b\u1ec1n, ki\u00ean c\u1ed1 d\u00e0nh cho con c\u00e1i. Ngo\u00e0i ra \"Kim\" c\u00f2n th\u1ec3 hi\u1ec7n s\u1ef1 qu\u00fd tr\u1ecdng, tr\u00e2n qu\u00fd c\u1ee7a m\u1ecdi ng\u01b0\u1eddi d\u00e0nh cho con. \"Kim Vy\" mang \u00fd ngh\u0129a c\u00f4 g\u00e1i nh\u1ecf nh\u1eafn, xinh \u0111\u1eb9p, c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac v\u00e0 ph\u00fa qu\u00fd", "sex": 5}
