{"first_name": "Lan Vy", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Lan\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa qu\u00fd, c\u00f3 h\u01b0\u01a1ng th\u01a1m, s\u1eafc \u0111\u1eb9p. T\u00ean \"Lan\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con g\u00e1i v\u1edbi mong mu\u1ed1n con l\u1edbn l\u00ean dung m\u1ea1o xinh \u0111\u1eb9p, t\u00e2m h\u1ed3n thanh cao, t\u00ednh t\u00ecnh d\u1ecbu d\u00e0ng, nh\u1eb9 nh\u00e0ng. \"Vy\" l\u00e0 nh\u1ecf nh\u1eafn, xinh x\u1eafn. \u0110\u1eb7t t\u00ean con l\u00e0 \"Lan Vy\" v\u1edbi mong mu\u1ed1n con nh\u01b0 lo\u00e0i hoa lan nh\u1ecf nh\u1eafn, xinh x\u1eafn, tr\u00e0n \u0111\u1ea7y s\u1ee9c s\u1ed1ng.", "sex": 5}
