{"first_name": "Ph\u00fac Vy", "meaning": "Ch\u1eef  \"Ph\u00fac\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 ch\u1ec9 nh\u1eefng s\u1ef1 t\u1ed1t l\u00e0nh (g\u1ed3m c\u00f3: gi\u00e0u sang, y\u00ean l\u00e0nh, s\u1ed1ng l\u00e2u, c\u00f3 \u0111\u1ee9c t\u1ed1t, vui h\u1ebft tu\u1ed5i tr\u1eddi), gi\u00e0u sang, may m\u1eafn. T\u00ean \"Ph\u00fac\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 ph\u1ea9m ch\u1ea5t t\u1ed1t, lu\u00f4n g\u1eb7p may m\u1eafn, c\u00f3 nhi\u1ec1u c\u01a1 h\u1ed9i t\u1ed1t trong cu\u1ed9c s\u1ed1ng, th\u01b0\u1eddng \u0111\u01b0\u1ee3c qu\u00fd nh\u00e2n gi\u00fap \u0111\u1ee1. \"Ph\u00fac Vy\"- con s\u1ebd l\u00e0 c\u00f4 g\u00e1i xinh \u0111\u1eb9p, lu\u00f4n g\u1eb7p may m\u1eafn t\u1ed1t l\u00e0nh.", "sex": 7}
