{"first_name": "B\u1ea1ch Ki\u00ean", "meaning": "\"B\u1ea1ch\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eafng, s\u00e1ng, m\u00e0u c\u1ee7a \u0111\u1ee9c h\u1ea1nh, t\u1eeb bi, tr\u00ed tu\u1ec7, th\u1ec3 hi\u1ec7n s\u1ef1 thanh cao c\u1ee7a t\u00e2m h\u1ed3n. B\u1ea1ch Ki\u00ean, th\u1ec3 hi\u1ec7n m\u1ed9t ng\u01b0\u1eddi con trai t\u00e0i gi\u1ecfi, tr\u00ed tu\u1ec7, gi\u00e0u l\u00f2ng th\u01b0\u01a1ng, t\u00e2m h\u1ed3n \u0111\u1eb9p, th\u00e1nh thi\u1ec7n.", "sex": 3}
{"first_name": "Ban Ki\u00ean", "meaning": "\"Ban\" c\u00f3 ngh\u0129a l\u00e0 b\u1ed9 ph\u1eadn, nh\u00f3m, th\u1ec3 hi\u1ec7n t\u00ednh tr\u1eadt t\u1ef1, nghi\u00eam t\u00fac, chu t\u1ea5t. Ban Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi c\u00f3 s\u1ef1 chu to\u00e0n, bi\u1ebft tr\u01b0\u1edbc sau, c\u00f3 t\u00ednh t\u01b0 duy, khoa h\u1ecdc, ng\u0103n n\u1eafp, \u0111a t\u00e0i", "sex": 3}
{"first_name": "B\u1eb1ng Ki\u00ean", "meaning": "\"B\u1eb1ng\" c\u00f3 ngh\u0129a l\u00e0 c\u00f4ng b\u1eb1ng, b\u00ecnh \u0111\u1eb3ng, kh\u00f4ng thi\u00ean v\u1ecb, b\u00ean tr\u1ecdng b\u00ean khinh, s\u1ed1ng th\u1eb3ng ngay. B\u1eb1ng Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi c\u00f3 l\u1eadp tr\u01b0\u1eddng, ch\u00ednh ki\u1ebfn r\u00f5 r\u00e0ng, m\u1ea1nh m\u1ebd, bi\u1ebft v\u01b0\u01a1n l\u00ean, c\u00f3 ph\u1ea9m ch\u1ea5t t\u1ed1t, \u0111\u00e1ng tin c\u1eady", "sex": 3}
{"first_name": "B\u00edch Ki\u00ean", "meaning": "\"B\u00edch\" \u00fd ch\u1ec9 vi\u00ean ng\u1ecdc b\u00edch, s\u1eafc x\u1ea3o, l\u1ed9ng l\u1eaby. B\u00edch Ki\u00ean, \u00fd n\u00f3i v\u1ebb \u0111\u1eb9p c\u1ee7a ng\u01b0\u1eddi con g\u00e1i ki\u00eau sa, c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, s\u00e1ng ng\u1eddi, m\u1ed9t ph\u1ea9m ch\u1ea5t cao qu\u00fd, ki\u00ean \u0111\u1ecbnh", "sex": 5}
{"first_name": "B\u00ecnh Ki\u00ean", "meaning": "\"B\u00ecnh\" c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 \u00eam th\u1ea5m, t\u00ednh t\u00ecnh hi\u1ec1n h\u00f2a, d\u1ec5 ch\u1ecbu. B\u00ecnh Ki\u00ean n\u00f3i l\u00ean s\u1ef1 nh\u1eb9 nh\u00e0ng, h\u01b0\u1edbng v\u1ec1 s\u1ef1 b\u00ecnh l\u1eb7ng, l\u1ed1i s\u1ed1ng thanh t\u1ecbnh, kh\u00f4ng xa hoa.", "sex": 3}
{"first_name": "B\u1ed9 Ki\u00ean", "meaning": "\"B\u1ed9\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 n\u1eafm gi\u1eef, b\u01b0\u1edbc ch\u00e2n, tr\u00f4ng coi t\u1ea5t c\u1ea3, l\u00e0 ng\u01b0\u1eddi quan tr\u1ecdng. B\u1ed9 Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi sau n\u00e0y c\u00f3 ch\u1ee9c c\u00f3 quy\u1ec1n, ra nh\u1eefng quy\u1ebft \u0111\u1ecbnh quan tr\u1ecdng, l\u00e0 ng\u01b0\u1eddi c\u00f3 ch\u1ee9c v\u1ee5 cao trong c\u01a1 quan", "sex": 3}
{"first_name": "B\u1ed9i Ki\u00ean", "meaning": "\"B\u1ed9i\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 th\u00eam v\u00e0o, k\u00ednh ph\u1ee5c, v\u1edbi con g\u00e1i c\u00f3 ngh\u0129a \u0111\u1ed3 trang s\u1ee9c. B\u1ed9i Ki\u00ean, \u00fd mu\u1ed1n n\u00f3i con c\u00e1i sau n\u00e0y s\u1ebd h\u01b0\u1edbng ph\u00e1t tri\u1ec3n \u0111\u1ed9c l\u1eadp, t\u01b0 duy t\u1ef1 l\u1eadp, l\u00e0m n\u00ean c\u01a1 \u0111\u1ed3, gi\u1ecfi giang, bi\u1ebft chinh ph\u1ee5c nh\u1eefng th\u1eed th\u00e1ch, n\u1ebfu l\u00e0 con g\u00e1i th\u00ec s\u1ebd l\u00e0 nh\u1eefng c\u00f4 n\u00e0ng xinh \u0111\u1eb9p, m\u1ea1nh m\u1ebd, c\u00f3 \u0111\u1ecba v\u1ecb cao trong x\u00e3 h\u1ed9i.", "sex": 7}
{"first_name": "B\u1eedu Ki\u00ean", "meaning": "\"B\u1eedu\" \u00fd ngh\u0129a c\u1ee7a ch\u1eef b\u1ea3o trong b\u1ea3o b\u1ed1i qu\u00fd gi\u00e1. B\u1eedu Ki\u00ean, \u00fd n\u00f3i nh\u01b0 m\u1ed9t vi\u00ean ng\u1ecdc ki\u00ean c\u01b0\u1eddng r\u1eafn ch\u1eafc, m\u00e0 cha m\u1eb9 mu\u1ed1n con c\u00e1i m\u00ecnh c\u0169ng ki\u00ean \u0111\u1ecbnh nh\u01b0 vi\u00ean ng\u1ecdc qu\u00fd \u0111\u00f3", "sex": 3}
{"first_name": "C\u1ea9m Ki\u00ean", "meaning": "\"C\u1ea9m\" Theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. C\u1ea9m Ki\u00ean, \u00fd mu\u1ed1n n\u00f3i v\u1ec1 m\u1ed9t ng\u01b0\u1eddi con g\u00e1i s\u1eafc b\u00e9n, c\u00f3 m\u1ed9t v\u1ebb \u0111\u1eb9p b\u00ean trong, th\u00f9y m\u1ecb, nhu m\u00ec, mang v\u1ebb \u0111\u1eb9p \u0111a m\u00e0u s\u1eafc v\u00e0 tinh t\u1ebf", "sex": 5}
{"first_name": "Cao Ki\u00ean", "meaning": "\"Cao\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 \u1edf ph\u00eda tr\u00ean, thanh cao, h\u00e0m \u00fd s\u1ef1 v\u01b0\u1ee3t tr\u1ed9i. Cao Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, h\u1ecdc th\u1ee9c cao, c\u00f3 \u0111\u1ecba v\u1ecb trong x\u00e3 h\u1ed9i, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi k\u00ednh tr\u1ecdng v\u00e0 n\u1ec3 ph\u1ee5c", "sex": 3}
{"first_name": "Ch\u00e2u Ki\u00ean", "meaning": "\"Ch\u00e2u\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 ng\u1ecdc trai, r\u1ef1c s\u00e1ng, thanh khi\u1ebft. Ch\u00e2u Ki\u00ean, th\u1ec3 hi\u1ec7n l\u00e0 m\u1ed9t ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, c\u00f3 ph\u1ea9m ch\u1ea5t, \u0111\u1ee9c h\u1ea1nh t\u1ed1t, \u0111\u1eb9p mang l\u1ea1i c\u1ea3m gi\u00e1c vui t\u01b0\u01a1i, ho\u00e0 nh\u00e3, cho m\u1ecdi ng\u01b0\u1eddi", "sex": 3}
{"first_name": "Chi Ki\u00ean", "meaning": "\"Chi\" ti\u1ebfng H\u00e1n - Vi\u1ec7t nghi\u0303a la\u0300 ca\u0300nh, trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh, \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i. Chi Ki\u00ean, \u00fd n\u00f3i m\u1ed9t ng\u01b0\u1eddi c\u00f3 t\u00e0i, s\u1eafc b\u00e9n, bi\u1ebft nh\u00ecn xa tr\u00f4ng r\u1ed9ng, c\u00f3 t\u00e0i, c\u00f3 ch\u1ee9c v\u1ee5 cao, thu\u1ed9c d\u00f2ng d\u00f5i cao qu\u00fd.", "sex": 7}
{"first_name": "Ch\u00ed Ki\u00ean", "meaning": "\"Ch\u00ed\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 \u00fd ch\u00ed, ch\u00ed h\u01b0\u1edbng, ch\u1ec9 s\u1ef1 quy\u1ebft t\u00e2m theo \u0111u\u1ed5i m\u1ed9t l\u00fd t\u01b0\u1edfng hay m\u1ee5c ti\u00eau n\u00e0o \u0111\u00f3. Ch\u00ed Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi lu\u00f4n bi\u1ebft s\u1eafp x\u1ebfp tr\u01b0\u1edbc m\u1ecdi c\u00f4ng vi\u1ec7c, c\u00f3 t\u1ea7m nh\u00ecn xa, t\u01b0 duy t\u1ed1t, c\u00f3 ch\u00ed c\u1ea7u ti\u1ebfn, v\u01b0\u01a1n xa, l\u00e0 ng\u01b0\u1eddi lu\u00f4n c\u00f3 ngh\u1ecb l\u1ef1c ph\u1ea5n \u0111\u1ea5u bi\u1ebft ch\u1edbp l\u1ea5y th\u1eddi c\u01a1", "sex": 3}
{"first_name": "Ch\u00ednh Ki\u00ean", "meaning": "\"Ch\u00ednh\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u00fang \u0111\u1eafn, th\u1eb3ng th\u1eafn, h\u1ee3p v\u1edbi quy ph\u1ea1m, \u0111\u00fang theo ph\u00e9p t\u1eafc. Ch\u00ednh Ki\u00ean, \u00fd cha m\u1eb9 mong mu\u1ed1n con c\u00e1i sau n\u00e0y s\u1ebd l\u00e0 ng\u01b0\u1eddi l\u01b0\u01a1ng thi\u1ec7n, thu\u1ea7n nh\u1ea5t, l\u00f2ng d\u1ea1 th\u1eb3ng th\u1eafn, kh\u00f4ng m\u01b0u \u0111\u1ed3 m\u1edd \u00e1m, lu\u00f4n quang minh ch\u00ednh \u0111\u1ea1i", "sex": 3}
{"first_name": "Chu Ki\u00ean", "meaning": "\"Chu\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 tr\u00f2n v\u1eb9n, t\u1ecf \u00fd \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p \u0111\u1ea7y \u0111\u1ee7, nghi\u00eam t\u00fac. Chu Ki\u00ean, l\u00e0 t\u00ean m\u00e0 cha m\u1eb9 mong mu\u1ed1n con c\u00e1i sau n\u00e0y c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng \u0111\u1ea7y \u0111\u1ee7 sung t\u00fac, vi\u00ean m\u00e3n, m\u1ecdi \u0111i\u1ec1u t\u1ed1t l\u00e0nh, \u0111\u1eb9p \u0111\u1ebd s\u1ebd \u0111\u1ebfn v\u1edbi con", "sex": 3}
{"first_name": "Chung Ki\u00ean", "meaning": "\"Chung\" \u00fd n\u00f3i s\u1ef1 chung th\u1ee7y, t\u1eadn t\u00ecnh, th\u01b0\u01a1ng y\u00eau. Chung Ki\u00ean th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi bi\u1ebft lo toan, ngh\u0129 s\u00e2u s\u1eafc, h\u01b0\u1edbng v\u1ec1 t\u00ecnh c\u1ea3m gia \u0111\u00ecnh, m\u1ed9t l\u00f2ng m\u1ed9t d\u1ea1 y\u00eau th\u01b0\u01a1ng gia \u0111\u00ecnh", "sex": 3}
{"first_name": "Chuy\u00ean Ki\u00ean", "meaning": "\"Chuy\u00ean\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u1eadp trung duy nh\u1ea5t, \u00fd n\u00f3i con ng\u01b0\u1eddi ch\u00edn ch\u1eafn, nghi\u00eam t\u00fac. Chuy\u00ean Ki\u00ean, th\u1ec3 hi\u1ec7n m\u1ed9t ng\u01b0\u1eddi m\u1ea1nh m\u1ebd, tr\u01b0\u1edfng th\u00e0nh trong suy ngh\u0129, l\u1ed1i s\u1ed1ng, m\u1ed9t con ng\u01b0\u1eddi ch\u1eefng ch\u1ea1c, t\u1ea1o s\u1ef1 \u1ed5n \u0111\u1ecbnh, l\u00e0 ni\u1ec1m tin, tr\u1ee5 c\u1ed9t trong gia \u0111\u00ecnh.", "sex": 3}
{"first_name": "C\u01a1 Ki\u00ean", "meaning": "\"C\u01a1\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 n\u1ec1n nh\u00e0, c\u0103n nguy\u00ean, ng\u1ee5 \u00fd v\u1ecb tr\u00ed g\u1ed1c r\u1ec5 quan tr\u1ecdng, vai tr\u00f2 quy\u1ebft \u0111\u1ecbnh t\u1ea5t c\u1ea3. C\u01a1 Ki\u00ean, th\u1ec3 hi\u1ec7n m\u1ed9t con ng\u01b0\u1eddi c\u00f3 kh\u00ed ch\u1ea5t, m\u1ea1nh m\u1ebd, c\u00f3 \u0111\u1ecba v\u1ecb trong x\u00e3 h\u1ed9i, m\u1ed9t ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, nh\u00e0 l\u00e3nh \u0111\u1ea1o c\u1ea5p cao, t\u1eebng l\u1eddi n\u00f3i r\u1ea5t c\u00f3 gi\u00e1 tr\u1ecb", "sex": 3}
{"first_name": "C\u00f4ng Ki\u00ean", "meaning": "\"C\u00f4ng\" \u00fd ch\u1ec9 c\u00f4ng b\u1eb1ng v\u00e0 ch\u00ednh tr\u1ef1c. C\u00f4ng Ki\u00ean, \u00fd mu\u1ed1n n\u00f3i ng\u01b0\u1eddi ngay th\u1eb3ng, li\u00eam ch\u00ednh, kh\u00f4ng v\u1ee5 l\u1ee3i c\u00e1 nh\u00e2n, lu\u00f4n c\u00f4ng b\u1eb1ng, \u0111em s\u1ef1 ch\u00ednh ngh\u0129a \u0111\u1eb7t h\u00e0ng \u0111\u1ea7u, th\u1ec3 hi\u1ec7n l\u00e0 ng\u01b0\u1eddi \u0111\u00e1ng tin c\u1eady, gi\u1ecfi giang, kh\u00f4ng g\u00ec chuy\u1ec3n d\u1eddi \u0111\u01b0\u1ee3c", "sex": 3}
{"first_name": "C\u00fac Ki\u00ean", "meaning": "\"C\u00fac\" ngh\u0129a l\u00e0 n\u00f3i v\u1ec1 lo\u00e0i hoa nh\u00ecn c\u00f3 v\u1ebb b\u00ecnh th\u01b0\u1eddng, tuy h\u01a1i m\u1ecfng manh nh\u01b0ng s\u00e2u s\u1eafc v\u00e0 tinh t\u1ebf. C\u00fac Ki\u00ean, mu\u1ed1n n\u00f3i \u0111\u1ebfn m\u1ed9t ng\u01b0\u1eddi con g\u00e1i d\u1ecbu d\u00e0ng, th\u00f9y m\u1ecb, l\u00e0 ng\u01b0\u1eddi bi\u1ebft \u0111\u1ec3 \u00fd, an \u1ee7i, lo l\u1eafng cho ng\u01b0\u1eddi kh\u00e1c, mang l\u1ea1i s\u1ef1 b\u00ecnh y\u00ean v\u00e0 c\u1ea3m gi\u00e1c nh\u01b0 \u0111\u01b0\u1ee3c che ch\u1edf cho ng\u01b0\u1eddi k\u1ebf b\u00ean", "sex": 5}
{"first_name": "\u0110\u1eafc Ki\u00ean", "meaning": "\"\u0110\u1eafc\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 c\u00f3 \u0111\u01b0\u1ee3c, h\u00e0m ngh\u0129a s\u1ef1 th\u00e0nh c\u00f4ng, k\u1ebft qu\u1ea3 t\u1ed1t \u0111\u1eb9p. \u0110\u1eafc Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi c\u00f3 b\u01b0\u1edbc ti\u1ebfn cao trong s\u1ef1 nghi\u1ec7p, m\u1ecdi th\u1ee9 \u0111\u1ec1u th\u00e0nh c\u00f4ng, th\u1eafng l\u1ee3i, quy\u1ebft th\u1eafng", "sex": 3}
{"first_name": "\u0110\u1ea1i Ki\u00ean", "meaning": "\"\u0110\u1ea1i\" \u00fd n\u00f3i tinh th\u1ea7n qu\u1ea3ng \u0111\u1ea1i, s\u1ef1 r\u1ed9ng r\u00e3i, quang minh ch\u00ednh \u0111\u1ea1i. \u0110\u1ea1i Ki\u00ean, \u00fd ch\u1ec9 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, h\u1ecdc r\u1ed9ng, hi\u1ec3u s\u00e2u, nh\u1eadn th\u1ee9c uy\u00ean th\u00e2m, lu\u00f4n \u0111i \u0111\u1ea7u trong s\u1ef1 nghi\u1ec7p", "sex": 3}
{"first_name": "\u0110an Ki\u00ean", "meaning": "\"\u0110an\" theo H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 l\u1ebb, chi\u1ebfc, \u00fd ch\u1ec9 s\u1ef1 \u0111\u01a1n gi\u1ea3n, kh\u00f4ng ph\u1ee9c t\u1ea1p, c\u1ea7u k\u1ef3. \u0110an Ki\u00ean, \u00fd n\u00f3i v\u1ec1 m\u1ed9t ng\u01b0\u1eddi c\u00f3 l\u1ed1i s\u1ed1ng gi\u1ea3n d\u1ecb, kh\u00f4ng ganh \u0111ua, c\u00f3 \u00fd ngh\u0129 gi\u1ea3n \u0111\u01a1n, tho\u1ea3i m\u00e1i, trong s\u00e1ng, th\u00e1nh thi\u1ec7n.", "sex": 3}
{"first_name": "\u0110ang Ki\u00ean", "meaning": "\"\u0110ang\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ng\u1ecdn \u0111\u00e8n. \u0110ang Ki\u00ean, \u00fd n\u00f3i m\u1ed9t ng\u01b0\u1eddi kh\u00f4i ng\u00f4, tu\u1ea5n t\u00fa, lu\u00f4n t\u00ecm t\u00f2i nh\u1eefng \u0111i\u1ec1u m\u1edbi l\u1ea1, t\u00e0i gi\u1ecfi, th\u00edch kh\u00e1m ph\u00e1, m\u1ea1nh m\u1ebd \u1edf t\u00ednh c\u00e1ch, t\u00e2m h\u00f4n v\u00f4 c\u00f9ng tinh anh, soi s\u00e1ng.", "sex": 3}
{"first_name": "\u0110\u0103ng Ki\u00ean", "meaning": "\"\u0110\u0103ng\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ng\u1ecdn \u0111\u00e8n, soi s\u00e1ng, tinh anh. \u0110\u0103ng Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi lu\u00f4n th\u00edch kh\u00e1m ph\u00e1, t\u01b0 duy h\u1ecdc h\u1ecfi, suy lu\u1eadn, s\u1ebd l\u00e0 ng\u01b0\u1eddi th\u00e0nh \u0111\u1ea1t nhanh khi lu\u00f4n l\u00e0 ng\u01b0\u1eddi \u0111i \u0111\u1ea7u, ti\u00ean phong,", "sex": 3}
{"first_name": "D\u0129 Ki\u00ean", "meaning": "\"D\u0129\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 l\u00fd do, ng\u1ee5 \u00fd s\u1ef1 kh\u1edfi \u0111\u1ea7u, xu\u1ea5t ph\u00e1t \u0111i\u1ec3m. D\u0129 Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi lu\u00f4n g\u1eb7p \u0111\u01b0\u1ee3c nhi\u1ec1u may m\u1eafn trong cu\u1ed9c s\u1ed1ng, kh\u1edfi \u0111\u1ea7u t\u1ed1t \u0111\u1eb9p, c\u00f3 qu\u00fd nh\u00e2n ph\u00f9 tr\u1ee3, con \u0111\u01b0\u1eddng s\u1ef1 nghi\u1ec7p t\u1ed1t l\u00e0nh", "sex": 5}
{"first_name": "Di\u1ec5m Ki\u00ean", "meaning": "\"Di\u1ec5m\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u1ed1t \u0111\u1eb9p, v\u1ebb t\u01b0\u01a1i s\u00e1ng, xinh \u0111\u1eb9p. Di\u1ec5m Ki\u00ean, ng\u1ee5 \u00fd mong mu\u1ed1n con c\u00e1i sau n\u00e0y c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac, ki\u00ean \u0111\u1ecbnh, n\u1ebfu l\u00e0 con g\u00e1i s\u1ebd c\u00f3 v\u1ebb \u0111\u1eb9p thanh t\u00fa, ho\u00e0n m\u1ef9, v\u1eeba xinh \u0111\u1eb9p l\u1ea1i v\u1eeba c\u00f3 t\u00e0i", "sex": 5}
{"first_name": "Di\u1ec7p Ki\u00ean", "meaning": "\"Di\u1ec7p\" ch\u00ednh l\u00e0 \"l\u00e1\" trong Kim Chi Ng\u1ecdc Di\u1ec7p (d\u1ecbch l\u00e0 c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc). Di\u1ec7p Ki\u00ean, \u00fd n\u00f3i cha m\u1eb9 mong mu\u1ed1n con c\u00e1i sau n\u00e0y gi\u1ecfi giang, th\u00e0nh \u0111\u1ea1t, \u0111a t\u00e0i, c\u00f3 \u00fd ch\u00ed v\u1eefng v\u00e0ng, \u0111\u1ed9c l\u1eadp, c\u00f3 ch\u00ed h\u01b0\u1edbng ph\u00e1t tri\u1ec3n s\u1ef1 nghi\u1ec7p, \u0111\u1ea1t th\u00e0nh qu\u1ea3 cao", "sex": 5}
{"first_name": "Di\u1ec7u Ki\u00ean", "meaning": "\"Di\u1ec7u\" l\u00e0 tuy\u1ec7t di\u1ec7u, \u00fd ch\u1ec9 nh\u1eefng \u0111i\u1ec1u tuy\u1ec7t v\u1eddi \u0111\u01b0\u1ee3c t\u1ea1o n\u00ean b\u1edfi s\u1ef1 kh\u00e9o l\u00e9o, k\u00ec di\u1ec7u. Di\u1ec7u Ki\u00ean, \u00fd ch\u1ec9 t\u00ean ng\u01b0\u1eddi con g\u00e1i c\u00f3 ph\u1ea9m h\u1ea1nh \u0111\u1eb9p, n\u1ebft na, th\u00f9y m\u1ecb, s\u00e2u s\u1eafc, nh\u1eb9 nh\u00e0ng, \u0111\u1eb9p ng\u01b0\u1eddi \u0111\u1eb9p n\u1ebft", "sex": 5}
{"first_name": "\u0110\u00f4 Ki\u00ean", "meaning": "\"\u0110\u00f4\" \u00fd n\u00f3i l\u00e0 m\u1ea1nh m\u1ebd, c\u1ee9ng c\u00e1p, h\u00f9ng d\u0169ng, r\u1ea1ng ng\u1eddi. \u0110\u00f4 Ki\u00ean, \u00fd n\u00f3i s\u1ef1 ch\u1eafc ch\u1eafn, ki\u00ean c\u1ed1 c\u1ee7a m\u1ed9t ng\u01b0\u1eddi \u0111\u00e0n \u00f4ng c\u00f3 b\u1ea3n l\u0129nh, y\u00eau th\u01b0\u01a1ng gia \u0111\u00ecnh, lu\u00f4n c\u1ea7u ti\u1ebfn, \u0111\u1ea1t \u0111\u01b0\u1ee3c danh l\u1ee3i", "sex": 3}
{"first_name": "Do\u00e3n Ki\u00ean", "meaning": "\"Do\u00e3n\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 ng\u01b0\u1eddi qu\u1ea3n l\u00fd, ng\u01b0\u1eddi c\u00f3 ch\u1ee9c ph\u1eadn cao c\u1ea5p. Do\u00e3n Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi sau n\u00e0y s\u1ebd n\u1eafm gi\u1eef ch\u1ee9c cao v\u1ecdng tr\u1ecdng, c\u00f3 ch\u1ee9c c\u00f3 quy\u1ec1n, thu\u1ed9c b\u1eadc ho\u00e0ng gia, th\u01b0\u1ee3ng l\u01b0u", "sex": 3}
{"first_name": "\u0110oan Ki\u00ean", "meaning": "\"\u0110oan\" \u00fd ch\u1ec9 ngay th\u1eb3ng, ch\u00ednh tr\u1ef1c, hi\u1ec1n th\u1ee5c, \u0111oan trang. \u0110oan Ki\u00ean, th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p t\u1eeb t\u00e2m h\u1ed3n v\u00e0 ph\u1ea9m ch\u1ea5t, bi\u1ebft y\u00eau th\u01b0\u01a1ng gia \u0111\u00ecnh, nh\u00e3 nh\u1eb7n, th\u00f9y m\u1ecb, n\u1ebft na", "sex": 5}
{"first_name": "\u0110o\u00e0n Ki\u00ean", "meaning": "\"\u0110o\u00e0n\" trong ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 tr\u00f2n, \u0111\u1ea7y, v\u1eeba v\u1eb7n. Cha m\u1eb9 mu\u1ed1n \u0111\u1eb7t t\u00ean con l\u00e0 \"\u0110o\u00e0n Ki\u00ean\" v\u1edbi mong mu\u1ed1n con sau n\u00e0y s\u1ebd c\u00f3 cu\u1ed9c s\u1ed1ng \u0111\u1ea7y \u0111\u1ee7, kh\u00f4ng lo \u00e2u, v\u00e0 c\u00f3 m\u1ed9t t\u00ecnh y\u00eau r\u1ed9ng l\u1edbn, bao dung, th\u01b0\u01a1ng y\u00eau t\u1ea5t c\u1ea3 m\u1ecdi ng\u01b0\u1eddi.", "sex": 3}
{"first_name": "Doanh Ki\u00ean", "meaning": "\"Doanh\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 \u0111\u1ea7y \u0111\u1ee7, r\u1ed9ng l\u1edbn, b\u1ec3 c\u1ea3, ng\u1ee5 \u00fd con ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng r\u1ed9ng r\u00e3i, \u0111\u1ee9c \u0111\u1ed9, t\u00e0i n\u0103ng. Doanh Ki\u00ean, th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi t\u00e0i tr\u00ed v\u1eb9n to\u00e0n, c\u00f3 b\u1ea3n l\u0129nh, t\u00e0i n\u0103ng xu\u1ea5t ch\u00fang, l\u00e0 ng\u01b0\u1eddi h\u1ecdc r\u1ed9ng, hi\u1ec3u s\u00e2u, c\u00f3 th\u1ec3 n\u1eafm gi\u1eef ch\u1ee9c v\u1ee5 l\u1edbn sau n\u00e0y.", "sex": 3}
{"first_name": "\u0110\u00f4ng Ki\u00ean", "meaning": "\"\u0110\u00f4ng\" \u00fd ch\u1ec9 ng\u01b0\u1eddi t\u1ec9nh t\u00e1o, c\u00f3 th\u00e1i \u0111\u1ed9 b\u00ecnh t\u0129nh, s\u00e2u s\u1eafc. \"Ki\u00ean\" n\u00f3i v\u1ec1 s\u1ef1 ch\u1eafc ch\u1eafn, c\u1ed1 \u0111\u1ecbnh, ch\u1eefng ch\u1ea1c. \u0110\u00f4ng Ki\u00ean, \u00fd n\u00f3i m\u1ed9t ng\u01b0\u1eddi con trai t\u00e0i gi\u1ecfi, s\u1eafc x\u1ea3o, s\u1ed1ng c\u00f3 \u00fd ch\u00ed", "sex": 3}
{"first_name": "Dung Ki\u00ean", "meaning": "\"Dung\" c\u00f3 ngh\u0129a l\u00e0 bao dung, v\u1ecb tha, th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng b\u00e1c \u00e1i. Dung Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi con g\u00e1i lu\u00f4n h\u01b0\u1edbng v\u1ec1 s\u1ef1 ch\u00e1nh thi\u1ec7n, h\u00f2a nh\u00e3, th\u01b0\u01a1ng y\u00eau m\u1ecdi ng\u01b0\u1eddi, l\u00e0 ng\u01b0\u1eddi c\u00f3 \u0111\u1ee9c, c\u00f3 t\u00e2m t\u1ed1t \u0111\u1eb9p", "sex": 5}
{"first_name": "D\u0169ng Ki\u00ean", "meaning": "\"D\u0169ng\" c\u00f3 ngh\u0129a l\u00e0 s\u1ee9c m\u1ea1nh, can \u0111\u1ea3m, ng\u01b0\u1eddi c\u00f3 kh\u00ed ph\u00e1ch, ng\u01b0\u1eddi gan d\u1ea1. D\u0169ng Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi t\u00e0i tr\u00ed v\u1eb9n to\u00e0n, lu\u00f4n ph\u1ea5n \u0111\u1ea5u \u0111i \u0111\u1ea7u, t\u00ecm t\u00f2i, h\u1ecdc h\u1ecfi, l\u00e0 ng\u01b0\u1eddi c\u00f3 \u00fd ch\u00ed c\u1ea7u ti\u1ebfn, n\u0103ng \u0111\u1ed9ng", "sex": 3}
{"first_name": "D\u01b0\u01a1ng Ki\u00ean", "meaning": "\"D\u01b0\u01a1ng\" trong Th\u00e1i D\u01b0\u01a1ng hay c\u00f2n g\u1ecdi l\u00e0 m\u1eb7t tr\u1eddi \u00fd ch\u1ec9 lu\u00f4n r\u1ea1ng ng\u1eddi, chi\u1ebfu s\u00e1ng. D\u01b0\u01a1ng Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi con trai m\u1ea1nh m\u1ebd, c\u00f3 \u00fd ch\u00ed v\u01b0\u01a1n l\u00ean, \u0111i \u0111\u1ea7u, bi\u1ebft ch\u1ecbu th\u01b0\u01a1ng ch\u1ecbu kh\u00f3, c\u00f3 t\u00ednh c\u1ea7u ti\u1ebfn trong x\u00e3 h\u1ed9i, c\u00f2n l\u00e0 m\u1ed9t ng\u01b0\u1eddi c\u00f3 t\u00e2m h\u1ed3n \u1ea5m \u00e1p, bao dung", "sex": 3}
{"first_name": "Duy Ki\u00ean", "meaning": "\"Duy\" trong ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u01b0 duy, suy ngh\u0129 th\u1ea5u \u0111\u00e1o. Duy Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi lu\u00f4n bi\u1ebft nh\u00ecn xa tr\u00f4ng r\u1ed9ng, t\u1ec9nh t\u00e1o tr\u01b0\u1edbc m\u1ed9t v\u1ea5n \u0111\u1ec1, l\u00fd tr\u00ed ki\u00ean \u0111\u1ecbnh v\u1eefng v\u00e0ng, gi\u1ea3i quy\u1ebft nh\u1eefng v\u1ea5n \u0111\u1ec1 th\u00f4ng minh, s\u00e1ng su\u1ed1t.", "sex": 3}
{"first_name": "Duy\u00ean Ki\u00ean", "meaning": "\"Duy\u00ean\" theo ngh\u0129a H\u00e1n Vi\u1ec7t \u00fd ch\u1ec9 s\u1ef1 h\u00e0i ho\u00e0, t\u1ebf nh\u1ecb, \u0111\u00e1ng y\u00eau, t\u1ea1o n\u00ean v\u1ebb h\u1ea5p d\u1eabn t\u1ef1 nhi\u00ean c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. Duy\u00ean Ki\u00ean, \u00fd n\u00f3i m\u1ed9t ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p, n\u1ebft na, th\u00f9y m\u1ecb v\u00e0 r\u1ea5t c\u00f3 b\u1ea3n l\u0129nh, ki\u00ean \u0111\u1ecbnh, t\u00e0i gi\u1ecfi, t\u00e0i s\u1eafc v\u1eb9n to\u00e0n.", "sex": 5}
{"first_name": "Gia Ki\u00ean", "meaning": "\"Gia\" trong ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f2n l\u00e0 gia \u0111\u00ecnh, l\u00e0 m\u00e1i nh\u00e0 n\u01a1i m\u1ecdi ng\u01b0\u1eddi sum v\u1ea7y, sinh ho\u1ea1t b\u00ean nhau. Gia Ki\u00ean, \u00fd cha m\u1eb9 mong mu\u1ed1n con c\u00e1i sau n\u00e0y, lu\u00f4n nh\u1edb v\u1ec1 qu\u00ea h\u01b0\u01a1ng, \u0111\u1ea5t t\u1ed5, gia \u0111\u00ecnh c\u1ed9i ngu\u1ed3n, lu\u00f4n chung th\u1ee7y, h\u01b0\u1edbng v\u1ec1 ngu\u1ed3n c\u1ed9i", "sex": 3}
{"first_name": "Giai Ki\u00ean", "meaning": "\"Giai\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 ho\u00e0n thi\u1ec7n, t\u1ed1t l\u00e0nh. Giai Ki\u00ean, \u00fd n\u00f3i mong mu\u1ed1n con c\u00e1i sau n\u00e0y lu\u00f4n g\u1eb7p nhi\u1ec1u may m\u1eafn trong s\u1ef1 nghi\u1ec7p, ti\u1ebfn xa h\u01a1n n\u1eefa, lu\u00f4n c\u00f3 ng\u01b0\u1eddi gi\u00fap \u0111\u1ee1 tr\u00ean m\u1ecdi n\u1ebbo \u0111\u01b0\u1eddng \u0111\u1eddi.", "sex": 5}
{"first_name": "Gi\u00e1m Ki\u00ean", "meaning": "\"Gi\u00e1m\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 g\u01b0\u01a1ng soi. Gi\u00e1m Ki\u00ean, \u00fd n\u00f3i con ng\u01b0\u1eddi ch\u00ednh tr\u1ef1c, r\u00f5 r\u00e0ng, minh b\u1ea1ch, nghi\u00eam t\u00fac, c\u00f4ng t\u01b0 ph\u00e2n minh, r\u1ea5t ki\u00ean \u0111\u1ecbnh.", "sex": 3}
{"first_name": "Gi\u00e1n Ki\u00ean", "meaning": "\"Gi\u00e1n\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 ng\u0103n c\u1ea3n, d\u1eebng l\u1ea1i, \u00fd ch\u1ec9 h\u00e0nh vi chu\u1ea9n m\u1ef1c, ch\u00ednh x\u00e1c, nghi\u00eam t\u00fac. Gi\u00e1n Ki\u00ean, \u00fd n\u00f3i m\u1ed9t ng\u01b0\u1eddi bi\u1ebft suy ngh\u0129 th\u1ea5u \u0111\u00e1o, c\u00f3 t\u00ednh th\u1eadn tr\u1ecdng, ch\u00ednh x\u00e1c, c\u00f3 l\u1ed1i suy ngh\u0129, t\u01b0 duy khoa h\u1ecdc, c\u00f3 t\u00ednh \u00fd th\u1ee9c cao, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi ch\u1eefng ch\u1ea1c, gi\u1ecfi giang.", "sex": 5}
{"first_name": "Giao Ki\u00ean", "meaning": "\"Giao\" ngh\u0129a l\u00e0 t\u00ean c\u1ee7a lo\u00e0i c\u1ecf giao, mong manh, b\u00ecnh d\u1ecb nh\u01b0ng m\u1ea1nh m\u1ebd, \u00fd ch\u00ed. T\u00ean \"Giao Ki\u00ean\" \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con v\u1edbi \u00fd ngh\u0129a mong con xinh \u0111\u1eb9p, hi\u1ec1n l\u00e0nh nh\u01b0ng b\u1ea3n t\u00ednh c\u1ee9ng c\u1ecfi, kh\u00f4ng d\u1ec5 \u0111\u1ea7u h\u00e0ng, c\u00f3 ti\u1ebfng t\u0103m v\u1eefng b\u1ec1n", "sex": 7}
