{"first_name": "\u00c1nh B\u1ed5n", "meaning": "T\u00ean \u00c1nh theo ngh\u0129a H\u00e1n Vi\u00ea\u0323t, g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng tia s\u00e1ng do m\u1ed9t v\u1eadt ph\u00e1t ra ho\u1eb7c ph\u1ea3n chi\u1ebfu l\u1ea1i, \u00e1nh s\u00e1ng ph\u1ea3n chi\u1ebfu l\u00f3ng l\u00e1nh, soi r\u1ecdi. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. V\u00ec v\u1eady \u0111\u1eb7t t\u00ean n\u00e0y cho con ng\u1ee5 \u00fd ch\u1ec9 s\u1ef1 th\u00f4ng minh, khai s\u00e1ng, kh\u1ea3 n\u0103ng tinh vi, t\u01b0\u1eddng t\u1eadn v\u1ea5n \u0111\u1ec1 c\u1ee7a con.", "sex": 7}
{"first_name": "Di\u1ec7p B\u1ed5n", "meaning": "\"Di\u1ec7p\" trong ti\u1ebfng H\u00e1n - Vi\u00ea\u0323t c\u00f3 ngh\u0129a l\u00e0 hi\u1ec3n h\u00e1ch, ch\u00f3i r\u1ecdi. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. K\u1ebft h\u1ee3p 2 ch\u1eef n\u00e0y \u0111\u1eb7t cho con, b\u1ed1 m\u1eb9 mong mu\u1ed1n r\u1eb1ng con sau n\u00e0y s\u1ebd c\u00f3 t\u00e0i ngh\u1ec7 h\u01a1n ng\u01b0\u1eddi, ti\u1ebfng vang hi\u1ec3n h\u00e1ch.", "sex": 7}
{"first_name": "Duy B\u1ed5n", "meaning": "Duy trong ti\u1ebfng H\u00e1n Vi\u00ea\u0323t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u01b0 duy, suy ngh\u0129 th\u1ea5u \u0111\u00e1o. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. Ng\u01b0\u1eddi t\u00ean \"Duy B\u1ed5n\" th\u01b0\u1eddng bi\u1ebft b\u00ecnh t\u0129nh gi\u1ea3i quy\u1ebft v\u1ea5n \u0111\u1ec1 kh\u00f4ng b\u1ed9p ch\u1ed9p h\u00e0nh x\u1eed, c\u00f3 tr\u00ed tu\u1ec7, th\u00f4ng minh & tinh t\u01b0\u1eddng.", "sex": 3}
{"first_name": "H\u1ea1nh B\u1ed5n", "meaning": "Theo H\u00e1n - Vi\u1ec7t, t\u00ean \"H\u1ea1nh\", th\u1ee9 nh\u1ea5t c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 ph\u00fac l\u1ed9c, l\u00e0 ph\u01b0\u1edbc l\u00e0nh. Ngh\u0129a th\u1ee9 hai l\u00e0 n\u00f3i v\u1ec1 m\u1eb7t \u0111\u1ea1o \u0111\u1ee9c, t\u00ednh n\u1ebft c\u1ee7a con ng\u01b0\u1eddi. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. T\u00ean \"H\u1ea1nh B\u1ed5n\" c\u00f3 th\u1ec3 d\u00f9ng cho c\u1ea3 nam l\u1eabn n\u1eef, \u00fd ch\u1ec9 ng\u01b0\u1eddi c\u00f3 b\u00e3n l\u0129nh v\u1edbi t\u00e2m h\u1ed3n \u0111\u1ee9c \u0111\u1ed9, khoan dung.", "sex": 5}
{"first_name": "Ho\u00e0i B\u1ed5n", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Ho\u00e0i\" c\u00f3 ngh\u0129a l\u00e0 nh\u1edb, l\u00e0 mong ch\u1edd, tr\u00f4ng ng\u00f3ng. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. T\u00ean \"Ho\u00e0i B\u1ed5n\" trong tr\u01b0\u1eddng h\u1ee3p n\u00e0y th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t d\u1ef1a tr\u00ean t\u00e2m t\u01b0 t\u00ecnh c\u1ea3m c\u1ee7a b\u1ed1 m\u1eb9. Ngo\u00e0i ra \"Ho\u00e0i B\u1ed5n\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 t\u1ea5m l\u00f2ng, l\u00e0 t\u00e2m t\u00ednh, t\u00ecnh \u00fd b\u00ean trong con ng\u01b0\u1eddi.", "sex": 7}
{"first_name": "Ho\u00e0ng B\u1ed5n", "meaning": "\"Ho\u00e0ng B\u1ed5n\" l\u00e0 m\u1ed9t t\u00ean hay d\u00f9ng \u0111\u1eb7t cho con trai v\u1edbi \"Ho\u00e0ng\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi v\u0129 \u0111\u1ea1i, c\u00f3 c\u1ed1t c\u00e1ch v\u01b0\u01a1ng gi\u1ea3, v\u1edbi mong mu\u1ed1n t\u01b0\u01a1ng lai ph\u00fa qu\u00fd, sang gi\u00e0u. Trong khi \u0111\u00f3, \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng.", "sex": 3}
{"first_name": "H\u1eefu B\u1ed5n", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, \"H\u1eefu\" c\u00f3 nhi\u1ec1u \u00fd ngh\u0129a tuy nhi\u00ean trong \u0111\u00f3 ngh\u0129a th\u01b0\u1eddng d\u00f9ng l\u00e0 c\u00f3, s\u1edf h\u1eefu. K\u1ebft h\u1ee3p c\u00f9ng \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. B\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean 'H\u1eefu B\u1ed5n\" cho con v\u1edbi hi v\u1ecdng r\u1eb1ng con tr\u01b0\u1edfng th\u00e0nh l\u00e0 ng\u01b0\u1eddi c\u00f3 b\u1ea3n l\u0129nh, \u0111\u0129nh \u0111\u1ea1c, c\u00f3 ch\u00ed kh\u00ed nam nhi.", "sex": 3}
{"first_name": "Kh\u00e1nh B\u1ed5n", "meaning": "\"Kh\u00e1nh\" t\u1ee9c l\u00e0 s\u1ef1 vui m\u1eebng, h\u1ea1nh ph\u00fac. K\u1ebft h\u1ee3p 2 ch\u1eef n\u00e0y \u0111\u1eb7t cho con, b\u1ed1 m\u1eb9 mong mu\u1ed1n r\u1eb1ng con sau n\u00e0y s\u1ebd c\u00f3 t\u00e0i ngh\u1ec7 h\u01a1n ng\u01b0\u1eddi. V\u00ec v\u1eady, \u0111\u1eb7t t\u00ean n\u00e0y cho con, b\u1ed1 m\u1eb9 ng\u1ee5 \u00fd r\u1eb1ng con lu\u00f4n l\u00e0 ch\u00ednh m\u00ecnh, l\u00e0 ng\u01b0\u1eddi kha\u0309ng kha\u0301i, b\u1ea3n l\u0129nh v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng m\u1ef9 m\u00e3n.", "sex": 3}
{"first_name": "Kim B\u1ed5n", "meaning": "\"Kim\" theo ti\u1ebfng H\u00e1n - Vi\u00ea\u0323t, c\u00f3 ngh\u0129a l\u00e0 ti\u1ec1n, l\u00e0 v\u00e0ng. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. T\u00ean \"Kim B\u1ed5n\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c cha m\u1eb9 \u0111\u1eb7t v\u1edbi h\u00e0m \u00fd mong mu\u1ed1n cu\u1ed9c s\u1ed1ng sung t\u00fac, ph\u00fa qu\u00fd v\u1eefng b\u1ec1n, ki\u00ean c\u1ed1 d\u00e0nh cho con c\u00e1i. Ngo\u00e0i ra \"Kim B\u1ed5n\" c\u00f2n th\u1ec3 hi\u1ec7n s\u1ef1 qu\u00fd tr\u1ecdng, tr\u00e2n qu\u00fd c\u1ee7a m\u1ecdi ng\u01b0\u1eddi d\u00e0nh cho con.", "sex": 7}
{"first_name": "M\u1ea1nh B\u1ed5n", "meaning": "M\u1ea1nh trong t\u1eeb \u0111i\u1ec3n Vi\u00ea\u0323t, \u0111\u01b0\u1ee3c d\u1ecbch l\u00e0 kh\u1ecfe kho\u1eafn, m\u1ea1nh m\u1ebd, t\u1eeb ch\u1ec9 v\u1ec1 v\u00f3c d\u00e1ng & s\u1ee9c l\u1ef1c c\u1ee7a con ng\u01b0\u1eddi. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. T\u00ean M\u1ea1nh B\u1ed5n c\u00f3 ngh\u0129a cha m\u1eb9 mong con tr\u1edf th\u00e0nh ng\u01b0\u1eddi kh\u1ecfe m\u1ea1nh, s\u1ee9c kh\u1ecfe t\u1ed1t, \u00edt b\u1ec7nh t\u1eadt, s\u1ed1ng m\u1ea1nh m\u1ebd, ki\u00ean c\u01b0\u1eddng.", "sex": 3}
{"first_name": "Minh B\u1ed5n", "meaning": "\"Minh\" c\u00f3 ngh\u0129a l\u00e0 chi\u1ebfu s\u00e1ng, s\u00e1ng r\u1ef1c r\u1ee1, s\u00e1ng ch\u00f3i. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. K\u1ebft h\u1ee3p 2 ch\u1eef n\u00e0y \u0111\u1eb7t cho con, b\u1ed1 m\u1eb9 mong mu\u1ed1n r\u1eb1ng con sau n\u00e0y s\u1ebd c\u00f3 t\u00e0i ngh\u1ec7 h\u01a1n ng\u01b0\u1eddi, v\u00e0 c\u00f3 t\u00e2m h\u1ed3n trong s\u00e1ng.", "sex": 3}
{"first_name": "Nam B\u1ed5n", "meaning": "\"Nam B\u1ed5n\" v\u1edbi \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. \"Nam\" nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam. T\u00ean \"Nam B\u1ed5n\" nh\u01b0 l\u1eddi nh\u1eafn, l\u1eddi d\u1ea1y c\u1ee7a cha m\u1eb9 ch\u1ec9 d\u1eabn \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn cho con tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a.", "sex": 3}
{"first_name": "Ng\u1ecdc B\u1ed5n", "meaning": "\"Ng\u1ecdc\" theo ti\u1ebfng H\u00e1n Vi\u00ea\u0323t l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. T\u00ean \"Ng\u1ecdc B\u1ed5n\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u1ecfa s\u00e1ng nh\u01b0 h\u00f2n ng\u1ecdc qu\u00fd, mang \u00fd ngh\u0129a l\u00e0 tr\u00e2n b\u1ea3o, l\u00e0 m\u00f3n qu\u00e0 qu\u00fd gi\u00e1 c\u1ee7a t\u1ea1o h\u00f3a.", "sex": 7}
{"first_name": "Nh\u1eadt B\u1ed5n", "meaning": "Nh\u1eadt B\u1ed5n hay c\u00f2n g\u1ecdi l\u00e0 Nh\u1eadt B\u1ea3n l\u00e0 danh t\u1eeb ri\u00eang ch\u1ec9 1 qu\u1ed1c gia c\u00f3 tr\u00ecnh \u0111\u1ed9 khoa h\u1ecdc k\u1ef9 thu\u1eadt ti\u00ean ti\u1ebfn h\u00e0ng \u0111\u1ea7u th\u1ebf gi\u1edbi. \u0110\u00e2y l\u00e0 m\u1ed9t c\u00e1i t\u00ean \u0111\u1eb9p th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con trai \u1edf Vi\u00ea\u0323t Nam. Ngo\u00e0i ra, theo ti\u1ebfng H\u00e1n, Nh\u1eadt c\u00f2n ngh\u0129a l\u00e0 m\u1eb7t tr\u1eddi, \u00fd ch\u1ec9 s\u1ef1 soi s\u00e1ng, r\u1ea1ng r\u1ee1.", "sex": 3}
{"first_name": "Ph\u01b0\u01a1ng B\u1ed5n", "meaning": "Ch\u1eef \"Ph\u01b0\u01a1ng\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi bi\u1ebft \u0111\u1ea1o l\u00fd l\u00e0m ng\u01b0\u1eddi, bi\u1ebft ph\u00e2n bi\u1ec7t t\u1ed1t x\u1ea5u, \u0111\u00fang sai. Th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi s\u00e1ng su\u1ed1t, tr\u00ed tu\u1ec7. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. T\u00ean \"Ph\u01b0\u01a1ng B\u1ed5n\" l\u00e0 mong mu\u1ed1n c\u1ee7a cha m\u1eb9, mu\u1ed1n con m\u00ecnh lu\u00f4n l\u00e0m nh\u1eefng \u0111i\u1ec1u t\u1ed1t, bi\u1ebft c\u00e1ch \u0111\u1ed1i nh\u00e2n x\u1eed th\u1ebf, l\u00e0m cha m\u1eb9 y\u00ean l\u00f2ng.", "sex": 7}
{"first_name": "Quang B\u1ed5n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, Quang c\u00f3 ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, t\u00ean Quang d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, s\u00e1ng su\u1ed1t, c\u00f3 t\u00e0i n\u0103ng. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. K\u1ebft h\u1ee3p 2 ch\u1eef n\u00e0y \u0111\u1eb7t cho con, b\u1ed1 m\u1eb9 mong mu\u1ed1n r\u1eb1ng con sau n\u00e0y s\u1ebd c\u00f3 t\u00e0i ngh\u1ec7 h\u01a1n ng\u01b0\u1eddi, ti\u1ebfng vang hi\u1ec3n h\u00e1ch. T\u00ean Quang B\u1ed5n l\u00e0 mong mu\u1ed1n c\u1ee7a ba m\u1eb9 mu\u1ed1n con m\u00ecnh l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, hi\u1ec3u bi\u1ebft v\u00e0 th\u00e0nh c\u00f4ng.", "sex": 3}
{"first_name": "Th\u00e1i B\u1ed5n", "meaning": "\"Th\u00e1i\" theo ngh\u0129a H\u00e1n - Vi\u00ea\u0323t c\u00f3 ngh\u0129a l\u00e0 hanh th\u00f4ng, thu\u1eadn l\u1ee3i, ch\u1ec9 s\u1ef1 y\u00ean vui, b\u00ecnh y\u00ean, th\u01b0 th\u00e1i. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. \u0110\u1eb7t con t\u00ean \"Th\u00e1i B\u1ed5n\" l\u00e0 mong con c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean vui v\u1ebb, t\u00e2m h\u1ed3n l\u1ea1c quan, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean", "sex": 3}
{"first_name": "Thanh B\u1ed5n", "meaning": "\"Thanh\" c\u00f3 ngh\u0129a l\u00e0 m\u00e0u xanh t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 trong s\u00e1ng. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. \"Thanh B\u1ed5n\" \u00fd n\u00f3i v\u1ec1 ng\u01b0\u1eddi thanh b\u1ea1ch, lu\u00f4n c\u00f3 kh\u00ed ch\u1ea5t \u0111i\u1ec1m \u0111\u1ea1m, nh\u1eb9 nh\u00e0ng v\u00e0 cao qu\u00fd.", "sex": 7}
{"first_name": "Th\u1ebf B\u1ed5n", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, Th\u1ebf c\u00f3 ngh\u0129a l\u00e0 quy\u1ec1n l\u1ef1c, s\u1ee9c m\u1ea1nh, uy l\u1ef1c. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. T\u00ean \"Th\u1ebf B\u1ed5n\" th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi kh\u1ecfe m\u1ea1nh, uy nghi, t\u00e0i gi\u1ecfi v\u00e0 c\u00f3 quy\u1ec1n l\u1ef1c trong tay.", "sex": 7}
{"first_name": "Thi\u00ean B\u1ed5n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u00ea\u0323t, \"Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eddi, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. T\u1ef1a nh\u01b0 b\u1ea7u tr\u1eddi bao la \u1ea5y, ng\u01b0\u1eddi t\u00ean \"Thi\u00ean B\u1ed5n\" th\u01b0\u1eddng \u0111\u0129nh \u0111\u1ea1c, lu\u00f4n m\u1ea1nh m\u1ebd, c\u00f3 c\u00e1i nh\u00ecn bao qu\u00e1t, t\u1ea7m nh\u00ecn r\u1ed9ng l\u1edbn.", "sex": 3}
{"first_name": "Tr\u00ed B\u1ed5n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Tr\u00ed\" l\u00e0 tr\u00ed kh\u00f4n, tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. T\u00ean \"Tr\u00ed B\u1ed5n\" l\u00e0 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, tr\u00ed tu\u1ec7, t\u00e0i gi\u1ecfi. Cha m\u1eb9 mong con l\u00e0 \u0111\u1ee9a con c\u00f3 tri th\u1ee9c, th\u1ea5u hi\u1ec3u \u0111\u1ea1o l\u00fd l\u00e0m ng\u01b0\u1eddi, t\u01b0\u01a1ng lai t\u01b0\u01a1i s\u00e1ng.", "sex": 3}
{"first_name": "Tr\u1ecdng B\u1ed5n", "meaning": "\"Tr\u1ecdng\" l\u00e0 ng\u01b0\u1eddi bi\u1ebft qu\u00fd tr\u1ecdng l\u1ebd ph\u1ea3i, s\u1ed1ng \u0111\u1ea1o l\u00fd, \u0111\u1ee9ng \u0111\u1eafn, lu\u00f4n ch\u1ecdn con \u0111\u01b0\u1eddng ngay th\u1eb3ng. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. Ng\u01b0\u1eddi t\u00ean \"Tr\u1ecdng B\u1ed5n\" th\u01b0\u1eddng c\u00f3 c\u1ed1t c\u00e1ch thanh cao, nghi\u00eam t\u00fac, s\u1ed1ng c\u00f3 \u0111\u1ea1o l\u00fd, c\u00f3 t\u00ecnh ngh\u0129a.", "sex": 3}
{"first_name": "Trung B\u1ed5n", "meaning": "Trung l\u00e0 l\u00f2ng trung th\u00e0nh, l\u00e0 s\u1ef1 t\u1eadn trung, kh\u00f4ng thay l\u00f2ng \u0111\u1ed5i d\u1ea1. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. \"Trung B\u1ed5n\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t t\u00ean cho ng\u01b0\u1eddi con trai v\u1edbi mong mu\u1ed1n lu\u00f4n gi\u1eef \u0111\u01b0\u1ee3c s\u1ef1 ki\u00ean trung, b\u1ea5t \u0111\u1ecbnh, \u00fd ch\u00ed s\u1eaft \u0111\u00e1, kh\u00f4ng b\u1ecb dao \u0111\u1ed9ng tr\u01b0\u1edbc b\u1ea5t k\u1ef3 ho\u00e0n c\u1ea3nh na\u0300o.", "sex": 3}
{"first_name": "Vi\u00ea\u0323t, B\u1ed5n", "meaning": "\"Vi\u00ea\u0323t B\u1ed5n\" l\u00e0 c\u00e1i t\u00ean v\u1eeba hay, v\u1eeba \u0111\u1ed9c \u0111\u00e1o, \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho c\u00e1c b\u00e9 trai v\u1edbi c\u00e1c \u00fd ngh\u0129a: \"Vi\u1ec7t\" xu\u1ea5t ph\u00e1t t\u1eeb t\u00ean c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, c\u0169ng c\u00f3 n\u00e9t ngh\u0129a ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi th\u00f4ng minh, \u01b0u vi\u1ec7t. Trong khi \u0111\u00f3, \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng.", "sex": 3}
{"first_name": "Vinh B\u1ed5n", "meaning": "\"Vinh\" t\u1ee9c hi\u1ec3n vinh, vinh d\u1ef1. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. K\u1ebft h\u1ee3p 2 ch\u1eef n\u00e0y \u0111\u1eb7t cho con, b\u1ed1 m\u1eb9 mong mu\u1ed1n r\u1eb1ng con sau n\u00e0y s\u1ebd c\u00f3 t\u00e0i ngh\u1ec7 h\u01a1n ng\u01b0\u1eddi, ti\u1ebfng vang hi\u1ec3n h\u00e1ch.", "sex": 3}
{"first_name": "Xu\u00e2n B\u1ed5n", "meaning": "Xu\u00e2n vi\u1ebft \u0111\u1ea7y \u0111\u1ee7 l\u00e0 m\u00f9a xu\u00e2n: m\u00f9a c\u1ee7a c\u00e2y c\u1ed1i \u0111\u00e2m ch\u1ed3i, n\u1ea3y l\u1ed9c, sinh s\u00f4i ph\u00e1t tri\u1ec3n. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. T\u00ean con v\u1edbi ng\u1ee5 \u00fd sau n\u00e0y con s\u1ebd ph\u00e1t huy h\u1ebft t\u1ea5t c\u1ea3 t\u00e0i n\u0103ng v\u1ed1n c\u00f3 c\u1ee7a m\u00ecnh.", "sex": 3}
{"first_name": "Y\u00ean B\u1ed5n", "meaning": "Y\u00ean l\u00e0 y\u00ean b\u00ecnh, y\u00ean \u1ea3. \"B\u1ed5n\" t\u1ee9c b\u1ed5n l\u0129nh, \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. Ng\u01b0\u1eddi mang t\u00ean Y\u00ean B\u1ed5n lu\u00f4n \u0111\u01b0\u1ee3c g\u1eedi g\u1eafm mong mu\u1ed1n c\u00f3 cu\u1ed9c s\u1ed1ng \u00fd ngh\u0129a, y\u00ean b\u00ecnh, t\u1ed1t \u0111\u1eb9p.", "sex": 7}
{"first_name": "Thanh B\u1ed9t", "meaning": "Thanh l\u00e0 trong l\u00e0nh, xanh m\u00e1t. Thanh B\u1ed9t th\u1ec3 hi\u1ec7n \u00fd ngh\u0129a con c\u00e1i s\u1ebd l\u1edbn l\u00ean t\u1ed1t \u0111\u1eb9p, m\u1ea1nh kh\u1ecfe, th\u00e0nh \u0111\u1ea1t.", "sex": 7}
