{"first_name": "Tr\u00ed Hi\u1ec1n", "meaning": "\"Tr\u00ed\" l\u00e0 kh\u00f4n th\u1ea5u \u0111\u1ea1o l\u00fd, hi\u1ec3u bi\u1ebft, tr\u00ed tu\u1ec7. Tr\u00ed Hi\u1ec1n l\u00e0 c\u00e1i t\u00ean mong mu\u1ed1n con v\u1eeba c\u00f3 tr\u00ed tu\u1ec7 v\u1eeba hi\u1ec1n h\u1eadu, \u0111\u1ee9c \u0111\u1ed9 trong cu\u1ed9c s\u1ed1ng", "sex": 5}
