{"first_name": "H\u00e0 Ki\u00ean", "meaning": "\"H\u00e0\" c\u00f3 ngh\u0129a l\u00e0 s\u00f4ng ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi m\u1ec1m m\u1ea1i, hi\u1ec1n h\u00f2a, xinh \u0111\u1eb9p. H\u00e0 Ki\u00ean, \u00fd n\u00f3i cha m\u1eb9 mong con g\u00e1i lu\u00f4n c\u1ee9ng r\u1eafn, c\u00f3 t\u00ednh \u0111\u1ed9c l\u1eadp, l\u00e0m n\u00ean s\u1ef1 nghi\u1ec7p, t\u00e0i s\u1eafc v\u1eb9n to\u00e0n", "sex": 7}
