{"first_name": "H\u1ea3i Ki\u00ean", "meaning": "\"H\u1ea3i\" c\u00f3 ngh\u0129a l\u00e0 bi\u1ec3n, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. H\u1ea3i Ki\u00ean, \u00fd n\u00f3i con ng\u01b0\u1eddi lu\u00f4n c\u00f3 \u00fd ch\u00ed v\u01b0\u01a1n xa, ti\u1ebfn b\u1ed9, c\u1ea7u to\u00e0n, t\u00ecm t\u00f2i, kh\u00e1m ph\u00e1 nh\u1eefng \u0111i\u1ec1u t\u1ed1t trong cu\u1ed9c s\u1ed1ng, c\u00f2n l\u00e0 m\u1ed9t con ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng r\u1ed9ng m\u1edf nh\u01b0 h\u00ecnh \u1ea3nh c\u1ee7a bi\u1ec3n kh\u01a1i.", "sex": 3}
{"first_name": "H\u00e0m Ki\u00ean", "meaning": "\"H\u00e0m\" theo ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 bao dung, bao b\u1ecdc, r\u1ed9ng l\u1edbn bao qu\u00e1t. H\u00e0m Ki\u00ean, \u00fd n\u00f3i con ng\u01b0\u1eddi ch\u00edn ch\u1eafn, c\u00f3 t\u01b0 duy r\u1ed9ng l\u1edbn, bi\u1ebft nh\u00ecn xa tr\u00f4ng r\u1ed9ng", "sex": 3}
