{"first_name": "H\u1eb1ng Ki\u00ean", "meaning": "\"H\u1eb1ng\" \u00fd ch\u1ec9 m\u1ed9t ng\u01b0\u1eddi con g\u00e1i c\u00f3 l\u00f2ng d\u1ea1 kh\u00f4ng \u0111\u1ed5i, \u00fd ch\u00ed ki\u00ean \u0111\u1ecbnh v\u1eefng v\u00e0ng. H\u1eb1ng Ki\u00ean, ch\u1ec9 s\u1ef1 chung th\u1ee7y, s\u1eaft son, m\u1ed9t l\u00f2ng m\u1ed9t d\u1ea1, v\u1eefng b\u1ec1n.", "sex": 5}
{"first_name": "H\u1ea1nh Ki\u00ean", "meaning": "\"H\u1ea1nh\" c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 ph\u00fac l\u1ed9c, l\u00e0 ph\u01b0\u1edbc l\u00e0nh. H\u1ea1nh Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi con g\u00e1i n\u1ebft na, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, \u0111\u00f4n h\u1eadu, ph\u1ea9m ch\u1ea5t cao \u0111\u1eb9p, c\u00f3 l\u1ed1i s\u1ed1ng ki\u00ean \u0111\u1ecbnh, t\u1ef1 l\u1eadp, m\u1ea1nh m\u1ebd", "sex": 5}
{"first_name": "H\u1ea3o Ki\u00ean", "meaning": "\"H\u1ea3o\" c\u00f3 ngh\u0129a l\u00e0 t\u1ed1t l\u00e0nh, t\u1ed1t \u0111\u1eb9p, ho\u00e0n h\u1ea3o. H\u1ea3o Ki\u00ean, \u00fd n\u00f3i mong mu\u1ed1n con c\u00e1i sau n\u00e0y gi\u1ecfi giang, kh\u00e9o l\u00e9o, m\u1ea1nh m\u1ebd, lu\u00f4n ho\u00e0n th\u00e0nh t\u1ed1t m\u1ecdi c\u00f4ng vi\u1ec7c", "sex": 3}
{"first_name": "Hi\u1ec1n Ki\u00ean", "meaning": "\"Hi\u1ec1n\" c\u00f3 ngh\u0129a l\u00e0 t\u1ed1t l\u00e0nh, c\u00f3 t\u00e0i c\u00f3 \u0111\u1ee9c. Hi\u1ec1n Ki\u00ean, \u00fd n\u00f3i m\u1ed9t ng\u01b0\u1eddi c\u00f3 t\u00ednh \u00f4n h\u00f2a, \u0111\u1eb1m th\u1eafm, th\u00e2n thi\u1ec7n, c\u00f3 t\u00e0i n\u0103ng v\u00e0 \u0111\u1ee9c h\u1ea1nh, suy ngh\u0129 r\u1ea5t b\u1ea3n l\u0129nh, s\u00e2u s\u1eafc.", "sex": 5}
{"first_name": "Hi\u1ec3n Ki\u00ean", "meaning": "\"Hi\u1ec3n\" c\u00f3 ngh\u0129a l\u00e0 v\u1ebb vang, th\u1ec3 hi\u1ec7n nh\u1eefng ng\u01b0\u1eddi c\u00f3 \u0111\u1ecba v\u1ecb trong x\u00e3 h\u1ed9i. Hi\u1ec3n Ki\u00ean, \u00fd ngh\u0129a l\u00e0 cha m\u1eb9 mong mu\u1ed1n ng\u01b0\u1eddi con sau n\u00e0y th\u00e0nh \u0111\u1ea1t, c\u00f3 m\u1ed9t t\u01b0\u01a1ng lai x\u00e1n l\u1ea1n, l\u00e0m r\u1ea1ng danh d\u00f2ng h\u1ecd, gia \u0111\u00ecnh, c\u00f3 ch\u00ed c\u1ea7u ti\u1ebfn", "sex": 3}
{"first_name": "Hi\u1ebfu Ki\u00ean", "meaning": "\"Hi\u1ebfu\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t l\u00e0 n\u1ec1n t\u1ea3ng \u0111\u1ea1o \u0111\u1ee9c, nh\u00e2n c\u00e1ch c\u1ee7a con ng\u01b0\u1eddi. Hi\u1ebfu Ki\u00ean, th\u1ec3 hi\u1ec7n l\u00e0 ng\u01b0\u1eddi tr\u01b0\u1edfng th\u00e0nh trong nh\u1eadn th\u1ee9c, suy ngh\u0129 th\u1ea5u \u0111\u00e1o, lu\u00f4n hi\u1ebfu th\u1ea3o, k\u00ednh y\u00eau nh\u1eefng b\u1eadc sinh th\u00e0nh", "sex": 3}
{"first_name": "Hoa Ki\u00ean", "meaning": "\"Hoa\" bi\u1ec3u t\u01b0\u1ee3ng s\u1ef1 sinh \u0111\u1ed9ng, t\u00f4 \u0111i\u1ec3m s\u1eafc m\u00e0u cho cu\u1ed9c s\u1ed1ng, \u0111\u1eb9p \u0111\u1ebd, xinh t\u01b0\u01a1i. Hoa Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi ph\u1ee5 n\u1eef c\u1ee7a th\u1eddi \u0111\u1ea1i m\u1edbi, mang v\u1ebb \u0111\u1eb9p qu\u00fd ph\u00e1i \u00c1 \u0110\u00f4ng, r\u1eafn r\u1ecfi v\u00e0 r\u1ea5t quy\u1ebfn r\u0169", "sex": 5}
{"first_name": "H\u00f2a Ki\u00ean", "meaning": "\"H\u00f2a\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 \u00eam \u1ea5m, y\u00ean \u1ed5n ch\u1ec9 s\u1ef1 thu\u1eadn h\u1ee3p. H\u00f2a Ki\u00ean, \u00fd ch\u1ec9 v\u1ec1 \u0111\u1ee9c t\u00ednh con ng\u01b0\u1eddi, hi\u1ec1n l\u00e0nh, th\u00e1i \u0111\u1ed9 t\u1eeb t\u1ed1n, h\u00f2a nh\u00e3, th\u01b0\u01a1ng y\u00eau ch\u00e2n th\u00e0nh", "sex": 3}
{"first_name": "Ho\u00e0i Ki\u00ean", "meaning": "\"Ho\u00e0i\" c\u00f3 ngh\u0129a l\u00e0 nh\u1edb, mong ch\u1edd, tr\u00f4ng ng\u00f3ng. Ho\u00e0i Ki\u00ean, \u00fd n\u00f3i con c\u00e1i sau n\u00e0y n\u00ean nh\u1edb v\u1ec1 c\u1ed9i ngu\u1ed3n, c\u00f4ng \u01a1n d\u01b0\u1ee1ng d\u1ee5c c\u1ee7a ng\u01b0\u1eddi sinh th\u00e0nh, y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng v\u1ea1n v\u1eadt", "sex": 3}
{"first_name": "H\u1ed3ng Ki\u00ean", "meaning": "\"H\u1ed3ng\" bi\u1ec3u t\u01b0\u1ee3ng cho s\u1ef1 may m\u1eafn, c\u00e1t t\u01b0\u1eddng, t\u01b0\u01a1i vui. H\u1ed3ng Ki\u00ean, \u00fd n\u00f3i m\u1ed9t ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p, t\u00e0i s\u1eafc v\u1eb9n to\u00e0n, \u0111a t\u00e0i, c\u00f3 ch\u00ed h\u01b0\u1edbng ti\u1ebfn b\u1ed9, th\u00edch phi\u00eau l\u01b0u", "sex": 5}
{"first_name": "H\u00f9ng Ki\u00ean", "meaning": "\"H\u00f9ng\" ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi d\u0169ng m\u1ea3nh, t\u00e0i gi\u1ecfi, \u0111\u00e1ng ng\u01b0\u1ee1ng m\u1ed9. H\u00f9ng Ki\u00ean, \u00fd cha m\u1eb9 mong mu\u1ed1n con c\u00e1i tr\u01b0\u1edfng th\u00e0nh trong c\u00e1ch suy ngh\u0129, m\u1ea1nh m\u1ebd, gi\u1ecfi giang, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi bi\u1ebft \u0111\u1ebfn, c\u00f4ng nh\u1eadn", "sex": 3}
{"first_name": "H\u01b0\u01a1ng Ki\u00ean", "meaning": "\"H\u01b0\u01a1ng\" ng\u1ee5 \u00fd ch\u1ec9 l\u00e0 qu\u00ea nh\u00e0, l\u00e0 n\u01a1i ch\u1ed1n x\u01b0a. \u0110\u1eb7t t\u00ean con \"H\u01b0\u01a1ng Ki\u00ean\" v\u1edbi mong mu\u1ed1n, d\u00f9 \u0111i b\u1ea5t c\u1ee9 \u0111\u00e2u, d\u00f9 t\u00e0i gi\u1ecfi nh\u01b0 th\u1ebf n\u00e0o th\u00ec con c\u00e1i ph\u1ea3i lu\u00f4n nh\u1edb v\u1ec1 c\u1ed9i ngu\u1ed3n, nh\u1edb v\u1ec1 c\u00f4ng \u01a1n sinh th\u00e0nh d\u01b0\u1ee1ng d\u1ee5c c\u1ee7a cha m\u1eb9.", "sex": 5}
{"first_name": "Kh\u1ea3 Ki\u00ean", "meaning": "\"Kh\u1ea3\" trong ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 c\u00f3 th\u1ec3, s\u1ebd l\u00e0m \u0111\u01b0\u1ee3c. Kh\u1ea3 Ki\u00ean, \u00fd cha m\u1eb9 mong mu\u1ed1n con c\u00e1i sau n\u00e0y d\u00f9 g\u1eb7p b\u1ea5t c\u1ee9 chuy\u1ec7n g\u00ec c\u0169ng c\u00f3 th\u1ec3 t\u1ef1 gi\u1ea3i quy\u1ebft, \u0111\u1ed1i ph\u00f3, d\u00f9ng t\u00e0i n\u0103ng, s\u1ef1 hi\u1ec3u bi\u1ebft c\u1ee7a m\u00ecnh \u0111\u1ec3 kh\u1eafc ph\u1ee5c, t\u1ea1o t\u00ednh t\u1ef1 l\u1eadp cao", "sex": 3}
{"first_name": "Khi\u00eam Ki\u00ean", "meaning": "\"Khi\u00eam\" ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 \u0111\u1ee9c t\u00ednh nh\u01b0\u1eddng nh\u1ecbn, \u00f4n h\u00f2a, b\u00ecnh d\u1ecb, th\u00e1i \u0111\u1ed9 t\u1eeb t\u1ed1n, nh\u00e3 nh\u1eb7n. Khi\u00eam Ki\u00ean, ch\u1ec9 ng\u01b0\u1eddi d\u00f9 th\u00e0nh c\u00f4ng \u0111\u1ebfn \u0111\u00e2u, ch\u1ee9c v\u1ee5 th\u1ebf n\u00e0o, n\u00ean bi\u1ebft tr\u01b0\u1edbc bi\u1ebft sau,kh\u00f4ng khoe khoang, ba hoa", "sex": 3}
{"first_name": "L\u00e2m Ki\u00ean", "meaning": "\"L\u00e2m\" \u00fd n\u00f3i s\u1ef1 m\u1ea1nh m\u1ebd, r\u1eafn ch\u1eafc, l\u00e0 ng\u01b0\u1eddi \u0111a t\u00e0i, tr\u1ecdng t\u00edn ngh\u0129a, ch\u1ecbu th\u01b0\u01a1ng ch\u1ecbu kh\u00f3. L\u00e2m Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi con trai s\u1ed1ng c\u00f3 ngh\u1ecb l\u1ef1c, t\u00ecm t\u00f2i nh\u1eefng \u0111i\u1ec1u m\u1edbi m\u1ebb, ph\u00e1t tri\u1ec3n b\u1ea3n th\u00e2n, \u0111i l\u00ean t\u1eeb s\u1ee9c l\u1ef1c, ki\u1ebfn th\u1ee9c, t\u1ea7m v\u00f3c c\u1ee7a m\u00ecnh", "sex": 3}
{"first_name": "Li\u1ec5u Ki\u00ean", "meaning": "\"Li\u1ec5u\" \u00fd ch\u1ec9 h\u00ecnh \u1ea3nh ng\u01b0\u1eddi ph\u1ee5 n\u1eef, mong manh, m\u1ec1m m\u1ea1i, trang \u0111\u00e0i. Li\u1ec5u Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi ph\u1ee5 n\u1eef ngo\u00e0i v\u1ebb \u0111\u1eb9p h\u00ecnh th\u1ec3 v\u00e0 t\u00e2m h\u1ed3n, h\u1ecd c\u00f2n c\u00f3 th\u1ec3 l\u00e0m n\u00ean nh\u1eefng \u0111i\u1ec1u quan tr\u1ecdng, l\u1edbn lao, gi\u1eef ch\u1ee9c v\u1ee5 quan tr\u1ecdng trong c\u01a1 quan, c\u01a1 s\u1edf", "sex": 5}
{"first_name": "L\u00fd Ki\u00ean", "meaning": "\"L\u00fd\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u1ebd ph\u1ea3i, ch\u1ec9 h\u00e0nh vi, s\u1ef1 vi\u1ec7c \u0111\u00fang \u0111\u1eafn. L\u00fd Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi c\u00f3 t\u00e2m t\u00ednh ngay th\u1eb3ng, ph\u1ea9m h\u1ea1nh t\u1ed1t \u0111\u1eb9p, s\u1ed1ng c\u00f3 l\u00fd t\u01b0\u1edfng, c\u1ea7u ti\u1ebfn, ti\u1ebfn b\u1ed9.", "sex": 5}
{"first_name": "Mai Ki\u00ean", "meaning": "\"Mai\" l\u00e0 m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p n\u1edf v\u00e0o \u0111\u1ea7u m\u00f9a xu\u00e2n - m\u1ed9t m\u00f9a xu\u00e2n tr\u00e0n tr\u1ec1 \u01b0\u1edbc m\u01a1 v\u00e0 hy v\u1ecdng. Mai Ki\u00ean, \u00fd n\u00f3i v\u1ec1 m\u1ed9t ng\u01b0\u1eddi con g\u00e1i c\u00f3 v\u1ebb \u0111\u1eb9p thanh m\u1ea3nh, v\u00f3c d\u00e1ng thanh t\u00fa, lu\u00f4n tr\u00e0n \u0111\u1ea7y s\u1ee9c s\u1ed1ng, v\u00e0 r\u1ea5t s\u1eafc s\u1ea3o, nh\u1ea1y b\u00e9n trong suy ngh\u0129.", "sex": 5}
{"first_name": "M\u1ea1nh Ki\u00ean", "meaning": "\"M\u1ea1nh\" l\u00e0 s\u1ef1 m\u1ea1nh m\u1ebd, th\u1ec3 hi\u1ec7n s\u1ee9c m\u1ea1nh v\u00e0 ch\u1eafc ch\u1eafc. M\u1ea1nh Ki\u00ean, \u00fd ch\u1ec9 cha m\u1eb9 mong mu\u1ed1n con c\u00e1i sau n\u00e0y lu\u00f4n ki\u00ean c\u01b0\u1eddng, kh\u00f4ng ng\u1ea1i kh\u00f3 kh\u0103n, mong con lu\u00f4n kh\u1ecfe m\u1ea1nh, c\u00f3 cu\u1ed9c s\u1ed1ng \u0111\u1ea7y \u0111\u1ee7, sung t\u00fac", "sex": 3}
{"first_name": "Mi Ki\u00ean", "meaning": "\"Mi Ki\u00ean\" c\u00e1i t\u00ean th\u1ec3 hi\u1ec7n v\u1ebb \u0111\u1eb9p c\u1ee7a m\u1ed9t ng\u01b0\u1eddi con g\u00e1i tr\u01b0\u1edfng th\u00e0nh trong suy ngh\u0129, trong t\u01b0 duy, nh\u1ea1y b\u00e9n v\u00e0 s\u1eafc x\u1ea3o.", "sex": 5}
{"first_name": "M\u1ed9c Ki\u00ean", "meaning": "\"M\u1ed9c\" \u0111\u01b0\u1ee3c hi\u1ec3u l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. M\u1ed9c Ki\u00ean, cha m\u1eb9 mong mu\u1ed1n con s\u1ed1ng gi\u1ea3n d\u1ecb, ph\u00fac h\u1eadu, ch\u1ea5t ph\u00e1c, m\u1ed9t cu\u1ed9c s\u1ed1ng b\u00ecnh d\u1ecb, an nh\u00e0n; t\u00e2m t\u00ednh chan h\u00f2a, th\u00e2n \u00e1i, c\u00f3 l\u1ed1i suy ngh\u0129 tr\u01b0\u1edfng th\u00e0nh, s\u00e2u s\u1eafc, nh\u1ea1y b\u00e9n.", "sex": 7}
{"first_name": "My Ki\u00ean", "meaning": "\"My\" trong ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau. My Ki\u00ean, \u00fd cha m\u1eb9 mong mu\u1ed1n con g\u00e1i t\u00e0i s\u1eafc v\u1eb9n to\u00e0n, xinh \u0111\u1eb9p, suy ngh\u0129 s\u00e2u s\u1eafc, c\u00f3 \u0111\u1ecba v\u1ecb trong x\u00e3 h\u1ed9i.", "sex": 5}
{"first_name": "M\u1ef9 Ki\u00ean", "meaning": "\"M\u1ef9\" ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p, t\u1ed1t l\u00e0nh, ho\u00e0n h\u1ea3o. M\u1ef9 Ki\u00ean, \u00fd n\u00f3i cha m\u1eb9 mong mu\u1ed1n con c\u00e1i l\u1edbn l\u00ean s\u1ebd xinh \u0111\u1eb9p, t\u00ednh t\u00ecnh hi\u1ec1n l\u00e0nh, m\u1ea1nh m\u1ebd, gi\u1ecfi giang", "sex": 5}
{"first_name": "Nam Ki\u00ean", "meaning": "\"Nam Ki\u00ean\" \u00fd n\u00f3i s\u1eafc v\u00f3c m\u1ea1nh m\u1ebd c\u1ee7a ng\u01b0\u1eddi nam, m\u1ed9t b\u1eadc nam nhi gi\u1ecfi giang, \u0111a t\u00e0i, tr\u00ed tu\u1ec7 xu\u1ea5t ch\u00fang.", "sex": 3}
{"first_name": "Ngh\u0129a Ki\u00ean", "meaning": "\"Ngh\u0129a\" \u00fd n\u00f3i l\u00e0 ng\u01b0\u1eddi tr\u00e2n tr\u1ecdng l\u1ebd ph\u1ea3i, bi\u1ebft tr\u01b0\u1edbc bi\u1ebft sau, s\u1ed1ng c\u00f3 \u0111\u1ea1o l\u00fd. Ngh\u0129a Ki\u00ean, \u00fd n\u00f3i l\u00e0 m\u1ed9t ng\u01b0\u1eddi t\u00e0i, nh\u01b0ng kh\u00f4ng ba hoa, kho\u00e1c l\u00e1c, ph\u00f4 tr\u01b0\u01a1ng, s\u1ed1ng lu\u00f4n c\u00f3 t\u00ecnh c\u00f3 ngh\u0129a, bi\u1ebft tr\u00e2n tr\u1ecdng nh\u1eefng g\u00ec qu\u00fd gi\u00e1 nh\u1ea5t b\u00ean m\u00ecnh", "sex": 3}
{"first_name": "Ng\u1ecdc Ki\u00ean", "meaning": "\"Ng\u1ecdc\" theo ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh. Ng\u1ecdc Ki\u00ean, \u00fd cha m\u1eb9 mong mu\u1ed1n con c\u00e1i sau n\u00e0y gi\u1ecfi giang, ki\u00ean \u0111\u1ecbnh d\u00f9 b\u1ea5t c\u1ee9 \u1edf \u0111\u00e2u, h\u01b0\u1edbng \u0111\u1ebfn nh\u1eefng \u0111i\u1ec1u m\u1edbi m\u1ebb, hi\u1ec7n \u0111\u1ea1i, l\u00e0m n\u00ean s\u1ef1 nghi\u1ec7p to l\u1edbn", "sex": 5}
{"first_name": "Nguy\u00ean Ki\u00ean", "meaning": "\"Nguy\u00ean\" l\u00e0 t\u1eeb ch\u1ec9 v\u00f9ng th\u1ea3o nguy\u00ean, \u0111\u1ed3ng c\u1ecf bao la, ngu\u1ed3n c\u1ed9i. Nguy\u00ean Ki\u00ean, \u00fd n\u00f3i v\u1ec1 ng\u01b0\u1eddi c\u00f3 suy ngh\u0129, cu\u1ed9c s\u1ed1ng gi\u1ea3n \u0111\u01a1n, b\u00ecnh d\u1ecb, s\u1ed1ng nhu h\u00f2a, y\u00eau th\u01b0\u01a1ng m\u1ecdi ng\u01b0\u1eddi, nh\u00e3 nh\u1eb7n, \u0111\u1ea7y t\u00ecnh th\u01b0\u01a1ng bao la", "sex": 7}
{"first_name": "Nh\u00e3 Ki\u00ean", "meaning": "\"Nh\u00e3\" l\u00e0 ng\u01b0\u1eddi h\u1ecdc th\u1ee9c uy\u00ean b\u00e1c, ph\u1ea9m h\u1ea1nh \u0111oan ch\u00ednh, n\u00f3i n\u0103ng nho nh\u00e3, nh\u1eb9 nh\u00e0ng. Nh\u00e3 Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi s\u1ed1ng khi\u00eam nh\u01b0\u1eddng, y\u00eau th\u01b0\u01a1ng m\u1ecdi ng\u01b0\u1eddi, t\u00ednh t\u00ecnh nho nh\u00e3, h\u00f2a \u0111\u1ed3ng v\u1edbi m\u1ecdi ng\u01b0\u1eddi", "sex": 7}
{"first_name": "Nh\u1eadt Ki\u00ean", "meaning": "\"Nh\u1eadt\" c\u00f3 ngh\u0129a l\u00e0 m\u1eb7t tr\u1eddi, l\u00e0 ban ng\u00e0y, \u00e1nh h\u00e0o quang. Nh\u1eadt Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi th\u00f4ng minh, gi\u1ecfi giang, lu\u00f4n h\u1ecdc h\u1ecfi, t\u00ecm t\u00f2i \u0111i l\u00ean, h\u1ecdc r\u1ed9ng hi\u1ec3u nhi\u1ec1u, c\u00f3 ch\u1ee9c c\u00f3 quy\u1ec1n sau n\u00e0y", "sex": 7}
{"first_name": "Ph\u00e1t Ki\u00ean", "meaning": "\"Ph\u00e1t\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 h\u1ed5 ph\u00e1ch, ch\u1ec9 v\u1ec1 v\u1eadt qu\u00fd gi\u00e1, b\u1ea3o b\u1ed1i. Ph\u00e1t Ki\u00ean, \u00fd n\u00f3i m\u1ed9t ng\u01b0\u1eddi nam c\u00f3 kh\u00ed ph\u00e1ch hi\u00ean ngang, c\u00f3 s\u1ee9c m\u1ea1nh n\u1ed9i t\u00e2m, xu\u1ea5t ch\u00fang, d\u0169ng c\u1ea3m v\u00e0 \u0111a t\u00e0i", "sex": 3}
{"first_name": "Phi Ki\u00ean", "meaning": "\"Phi\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi nhanh nh\u1eb9n trong suy ngh\u0129, t\u00ednh c\u00e1ch c\u0169ng nh\u01b0 h\u00e0nh \u0111\u1ed9ng. Phi Ki\u00ean, l\u00e0 m\u1ed9t con ng\u01b0\u1eddi m\u1ea1nh m\u1ebd, c\u00f3 t\u00ednh h\u00f2a nh\u00e3, th\u00f4ng minh, s\u00e1ng d\u1ea1, l\u00e0m \u0111\u01b0\u1ee3c nhi\u1ec1u \u0111i\u1ec1u phi th\u01b0\u1eddng v\u00e0 v\u01b0\u01a1n t\u1edbi nh\u1eefng t\u1ea7m cao", "sex": 3}
{"first_name": "Phong Ki\u00ean", "meaning": "\"Phong\" ch\u1ec9 ng\u01b0\u1eddi m\u1ea1nh m\u1ebd, c\u00f3 kh\u1ea3 n\u0103ng l\u00e3nh \u0111\u1ea1o, ch\u1ec9 huy ng\u01b0\u1eddi kh\u00e1c. Phong Ki\u00ean, l\u00e0 ng\u01b0\u1eddi d\u00e1m ngh\u0129 d\u00e1m l\u00e0m, ra quy\u1ebft \u0111\u1ecbnh \u0111\u00fang \u0111\u1eafn, bi\u1ebft nh\u00ecn xa tr\u00f4ng r\u1ed9ng, l\u00e0m n\u00ean s\u1ef1 nghi\u1ec7p l\u1edbn", "sex": 3}
{"first_name": "Ph\u00fac Ki\u00ean", "meaning": "\"Ph\u00fac\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 ch\u1ec9 nh\u1eefng s\u1ef1 t\u1ed1t l\u00e0nh, y\u00ean l\u00e0nh, ph\u01b0\u1edbc ban cho. Ph\u00fac Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, c\u00f3 ph\u1ea9m ch\u1ea5t t\u1ed1t, lu\u00f4n g\u1eb7p may m\u1eafn trong cu\u1ed9c s\u1ed1ng, th\u01b0\u1eddng \u0111\u01b0\u1ee3c qu\u00fd nh\u00e2n gi\u00fap \u0111\u1ee1, m\u00e0 b\u1ea5t c\u1ee9 cha m\u1eb9 n\u00e0o c\u0169ng mong con m\u00ecnh \u0111\u01b0\u1ee3c s\u1ed1ng trong gi\u00e0u sang v\u00e0 g\u1eb7p nhi\u1ec1u may m\u1eafn", "sex": 3}
{"first_name": "Ph\u01b0\u1edbc Ki\u00ean", "meaning": "\"Ph\u01b0\u1edbc\" ngh\u0129a l\u00e0 may m\u1eafn, \u0111i\u1ec1u t\u1ed1t l\u00e0nh. T\u00ean \"Ph\u01b0\u1edbc Ki\u00ean\" \u00fd cha m\u1eb9 mong mu\u1ed1n con c\u00e1i sau n\u00e0y g\u1eb7p \u0111\u01b0\u1ee3c may m\u1eafn tr\u00ean b\u01b0\u1edbc \u0111\u01b0\u1eddng \u0111\u1eddi, th\u00e0nh c\u00f4ng trong s\u1ef1 nghi\u1ec7p, cu\u1ed9c s\u1ed1ng, t\u00ednh t\u00ecnh nh\u00e2n h\u1eadu, hi\u1ec1n l\u00e0nh v\u00e0 bao dung.", "sex": 3}
{"first_name": "Ph\u01b0\u01a1ng Ki\u00ean", "meaning": "\"Ph\u01b0\u01a1ng\" ch\u1ec9 ng\u01b0\u1eddi bi\u1ebft \u0111\u1ea1o l\u00fd l\u00e0m ng\u01b0\u1eddi, bi\u1ebft ph\u00e2n bi\u1ec7t t\u1ed1t x\u1ea5u, \u0111\u00fang sai. Ph\u01b0\u01a1ng Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7, s\u00e1ng su\u1ed1t, bi\u1ebft nh\u00ecn xa tr\u00f4ng r\u1ed9ng, bi\u1ebft c\u00e1ch \u0111\u1ed1i nh\u00e2n x\u1eed th\u1ebf, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi tin y\u00eau", "sex": 5}
{"first_name": "Quang Ki\u00ean", "meaning": "\"Quang\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, s\u00e1ng su\u1ed1t, c\u00f3 t\u00e0i n\u0103ng. Quang Ki\u00ean, \u00fd ch\u1ec9 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, bi\u1ebft v\u01b0\u01a1n l\u00ean, th\u00e0nh c\u00f4ng trong s\u1ef1 nghi\u1ec7p, l\u00e0m r\u1ea1ng danh gia \u0111\u00ecnh", "sex": 3}
{"first_name": "Q\u00fay Ki\u00ean", "meaning": "\"Qu\u00fd\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ecba v\u1ecb cao \u0111\u01b0\u1ee3c coi tr\u1ecdng, \u01b0u vi\u1ec7t, l\u00e0 s\u1ef1 qu\u00fd tr\u1ecdng. Qu\u00fd Ki\u00ean, \u00fd cha m\u1eb9 mong mu\u1ed1n con c\u00e1i lu\u00f4n \u0111\u01b0\u1ee3c sung t\u00fac, s\u1ed1ng trong s\u1ef1 gi\u00e0u sang, ph\u00fa qu\u00fd trong t\u01b0\u01a1ng lai", "sex": 7}
{"first_name": "Qu\u1ef3nh Ki\u00ean", "meaning": "\"Qu\u1ef3nh\" l\u00e0 m\u1ed9t vi\u00ean ng\u1ecdc \u0111\u1eb9p v\u00e0 thanh t\u00fa. Qu\u1ef3nh Ki\u00ean, \u00fd ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i c\u00f3 v\u1ebb \u0111\u1eb9p nhu m\u00ec, thanh cao, c\u1ee9ng c\u1ecfi, c\u00f3 l\u1ed1i s\u1ed1ng \u0111\u1eb9p", "sex": 5}
{"first_name": "Sinh Ki\u00ean", "meaning": "\"Sinh Ki\u00ean\" \u00fd n\u00f3i ng\u01b0\u1eddi c\u00f3 t\u00e0i, dung m\u1ea1o xu\u1ea5t ch\u00fang, suy ngh\u0129 s\u00e2u s\u1eafc, m\u1ea1nh m\u1ebd, l\u00e0 ng\u01b0\u1eddi h\u1ecdc cao, hi\u1ec3u bi\u1ebft r\u1ed9ng, \u0111a t\u00e0i.", "sex": 3}
{"first_name": "S\u01a1n Ki\u00ean", "meaning": "\"S\u01a1n\" l\u00e0 n\u00fai, t\u00ednh ch\u1ea5t c\u1ee7a n\u00fai l\u00e0 lu\u00f4n v\u1eefng ch\u00e3i, h\u00f9ng d\u0169ng v\u00e0 tr\u1ea7m t\u0129nh. S\u01a1n Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi c\u00f3 b\u1ea3n l\u0129nh, d\u00e1m ngh\u0129 d\u00e1m l\u00e0m, lu\u00f4n \u0111i \u0111\u1ea7u trong c\u00f4ng vi\u1ec7c, v\u00e0 l\u00e0 ch\u1ed7 d\u1ef1a v\u1eefng ch\u1eafc cho gia \u0111\u00ecnh", "sex": 3}
{"first_name": "Song Ki\u00ean", "meaning": "\"Song Ki\u00ean\" \u00fd n\u00f3i ng\u01b0\u1eddi \u0111a t\u00e0i, v\u0103n v\u00f5 song to\u00e0n, c\u00e2n \u0111\u1ed1i, th\u1ec3 hi\u1ec7n t\u00ednh ho\u00e0n h\u1ea3o, c\u00f3 kh\u00ed ch\u1ea5t m\u1ea1nh m\u1ebd c\u1ee7a m\u1ed9t ng\u01b0\u1eddi l\u00e3nh \u0111\u1ea1o", "sex": 3}
{"first_name": "T\u00e0i Ki\u00ean", "meaning": "\"T\u00e0i\" c\u00f3 ngh\u0129a l\u00e0 kh\u1ea3 n\u0103ng, tr\u00ed tu\u1ec7, n\u0103ng l\u1ef1c thi\u00ean ph\u00fa, b\u1ea9m t\u00ednh. T\u00e0i Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi lu\u00f4n h\u01b0\u1edbng \u0111\u1ebfn s\u1ef1 th\u00e0nh \u0111\u1ea1t trong t\u01b0\u01a1ng lai, c\u00f3 s\u1ef1 c\u1ea7u ti\u1ebfn, mu\u1ed1n chinh ph\u1ee5c \u0111\u1ec9nh cao", "sex": 3}
{"first_name": "T\u00e2m Ki\u00ean", "meaning": "\"T\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 t\u00e2m h\u1ed3n, l\u00e0 t\u00ecnh c\u1ea3m, l\u00e0 tinh th\u1ea7n. T\u00e2m Ki\u00ean, \u00fd n\u00f3i con ng\u01b0\u1eddi hi\u1ec1n h\u00f2a, lu\u00f4n h\u01b0\u1edbng thi\u1ec7n, c\u00f3 ph\u1ea9m ch\u1ea5t t\u1ed1t, c\u00f3 l\u1ed1i suy ngh\u0129 ch\u00edn ch\u1eafn, l\u00e0 m\u1ed9t con ng\u01b0\u1eddi h\u01b0\u1edbng \u0111\u1ebfn s\u1ef1 y\u00ean b\u00ecnh, gi\u1ea3n d\u1ecb", "sex": 7}
{"first_name": "T\u00e2n Ki\u00ean", "meaning": "\"T\u00e2n\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 m\u1edbi l\u1ea1, m\u1edbi m\u1ebb. T\u00e2n Ki\u00ean, \u00fd mu\u1ed1n ch\u1ec9 ng\u01b0\u1eddi con trai lu\u00f4n mu\u1ed1n h\u1ecdc h\u1ecfi, t\u00ecm t\u00f2i, kh\u00e1m ph\u00e1 nhi\u1ec1u \u0111i\u1ec1u hay, trau d\u1ed3i ki\u1ebfn th\u1ee9c, n\u00e2ng cao t\u1ea7m hi\u1ec3u bi\u1ebft \u0111\u1ec3 ph\u00e1t tri\u1ec3n b\u1ea3n th\u00e2n.", "sex": 3}
{"first_name": "T\u1ea5n Ki\u00ean", "meaning": "\"T\u1ea5n\" ngh\u0129a l\u00e0 ti\u1ebfn l\u00ean, th\u1ec3 hi\u1ec7n s\u1ef1 ph\u00e1t tri\u1ec3n, th\u0103ng ti\u1ebfn. T\u1ea5n Ki\u00ean, \u00fd ch\u1ec9 ng\u01b0\u1eddi th\u00e2n thi\u1ec7n, h\u00f2a \u0111\u1ed3ng, quan t\u00e2m t\u1edbi ng\u01b0\u1eddi kh\u00e1c, v\u1eeba l\u00e0 ng\u01b0\u1eddi c\u00f3 ti\u1ec1n \u0111\u1ed3, s\u1ef1 nghi\u1ec7p th\u0103ng ti\u1ebfn, v\u1eefng m\u1ea1nh", "sex": 3}
{"first_name": "An K\u1ef3", "meaning": "Trong ti\u1ebfng H\u00e1n, ch\u1eef \"K\u1ef3\" c\u00f3 th\u1ec3 hi\u1ec3u th\u00e0nh nhi\u1ec1u ngh\u0129a nh\u01b0 l\u00e1 c\u1edd, qu\u00e2n c\u1edd\u2026 tuy nhi\u00ean khi d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean, \"K\u1ef3\" l\u1ea1i mang \u00fd ngh\u0129a r\u1ea5t t\u1ed1t \u0111\u1eb9p. N\u1ebfu \u0111\u1eb7t t\u00ean cho con g\u00e1i \"k\u1ef3\" c\u00f3 ngh\u0129a ngh\u0129a l\u00e0 m\u1ed9t vi\u00ean ng\u1ecdc \u0111\u1eb9p, n\u1ebfu \u0111\u1eb7t t\u00ean cho con trai th\u00ec \"K\u1ef3\" c\u00f3 ngh\u0129a l\u00e0 to l\u1edbn, m\u1ea1nh m\u1ebd, mang t\u1ea7m v\u00f3c l\u1edbn lao, th\u1ec3 hi\u1ec7n b\u1ea3n l\u0129nh v\u00e0 tr\u1ecdng tr\u00e1ch c\u1ee7a ng\u01b0\u1eddi con trai.T\u00ean An theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 m\u1ed9t c\u00e1i t\u00ean nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. K\u00ea\u0301t h\u01a1\u0323p \"An Ky\u0300 \" la\u0300 ca\u0301i t\u00ean hay b\u00f4\u0301 me\u0323 co\u0301 th\u00ea\u0309 du\u0300ng \u0111\u0103\u0323t \u0111\u0103\u0323t cho ca\u0309 trai l\u00e2\u0303n ga\u0301i \u0111\u00ea\u0309 g\u01b0\u0309i g\u0103\u0301m ni\u00ea\u0300m mong \u0111\u01a1\u0323i, hi vo\u0323ng.", "sex": 7}
{"first_name": "Gia K\u1ef3", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Gia\" c\u00f2n l\u00e0 gia \u0111\u00ecnh, l\u00e0 m\u00e1i nh\u00e0 n\u01a1i m\u1ecdi ng\u01b0\u1eddi sum v\u1ea7y, sinh ho\u1ea1t b\u00ean nhau. Ngo\u00e0i ra ch\u1eef Gia c\u00f2n c\u00f3 ngh\u0129 l\u00e0 xinh \u0111\u1eb9p, \u01b0u t\u00fa, mang ph\u1ea9m ch\u1ea5t cao qu\u00fd.\"K\u1ef3\" c\u00f3 th\u1ec3 hi\u1ec3u th\u00e0nh nhi\u1ec1u ngh\u0129a nh\u01b0 l\u00e1 c\u1edd, qu\u00e2n c\u1edd\u2026 tuy nhi\u00ean khi d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean, \"K\u1ef3\" l\u1ea1i mang \u00fd ngh\u0129a r\u1ea5t t\u1ed1t \u0111\u1eb9p.\"Gia K\u1ef3\" Con l\u00e0 ng\u01b0\u1eddi c\u00f3 ph\u1ea9m ch\u1ea5t cao \u0111\u1eb9p, c\u1ee9ng c\u1ecfi, v\u00e0 l\u00e0 ni\u1ec1m t\u1ef1 h\u00e0o c\u1ee7a gia \u0111\u00ecnh.", "sex": 3}
