{"first_name": "Lan Th\u1ea1ch", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Lan\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa qu\u00fd, c\u00f3 h\u01b0\u01a1ng th\u01a1m v\u00e0 s\u1eafc \u0111\u1eb9p. \"Th\u1ea1ch\" l\u00e0 \u0111\u00e1. Th\u1ea1ch Lan l\u00e0 hoa lan b\u1eb1ng \u0111\u00e1. T\u00ean n\u00e0y \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi \u00fd ngh\u0129a cao qu\u00fd, xinh \u0111\u1eb9p, thanh khi\u1ebft, d\u1ecbu d\u00e0ng", "sex": 5}
{"first_name": "Li\u00ean Th\u1ea1ch", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen Th\u1ea1ch l\u00e0 \u0111\u00e1. Li\u00ean Th\u1ea1ch l\u00e0 hoa sen \u0111\u00e1 bi\u1ec3u t\u01b0\u1ee3ng t\u1ea5m l\u00f2ng son s\u1eaft trong t\u00ecnh b\u1ea1n v\u00e0 t\u00ecnh y\u00eau. Mang \u00fd ngh\u0129a con s\u1ebd xinh \u0111\u1eb9p, ngoan hi\u1ec1n, c\u00f3 t\u1ea5m l\u00f2ng bi\u1ebft y\u00eau th\u01b0\u01a1ng & chung th\u1ee7y", "sex": 5}
{"first_name": "Minh Th\u1ea1ch", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t,\"Minh\" c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, nhanh nh\u1eb9n, tinh anh. \"Th\u1ea1ch\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u00e1, t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 c\u1ee9ng c\u1ecfi, trung th\u00e0nh. T\u00ean \"Minh Th\u1ea1ch\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi th\u00f4ng minh, t\u00e0i tr\u00ed, m\u1ea1nh m\u1ebd, ki\u00ean c\u01b0\u1eddng. \u0110\u1eb7t con t\u00ean \"Minh Th\u1ea1ch\" l\u00e0 mong con sau n\u00e0y c\u00f3 t\u01b0\u01a1ng lai t\u01b0\u01a1i s\u00e1ng, th\u00e0nh c\u00f4ng v\u00e0 l\u00e0 ch\u1ed7 d\u1ef1a v\u1eb5ng ch\u1eafc cho c\u1ea3 gia \u0111\u00ecnh", "sex": 3}
{"first_name": "M\u1ef9 Th\u1ea1ch", "meaning": "M\u1ef9 c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p, t\u1ed1t l\u00e0nh theo ki\u1ec3u nh\u1eb9 nh\u00e0ng m\u1ec1m m\u1ea1i. Th\u1ea1ch c\u00f3 ngh\u0129a l\u00e0 \u0111\u00e1, trong t\u00ean g\u1ecdi th\u01b0\u1eddng mang \u00fd ngh\u0129a l\u00e0 \u0111\u00e1 qu\u00fd. Th\u1ea1ch M\u1ef9 ngh\u0129a l\u00e0 con xinh \u0111\u1eb9p, m\u1ed9c m\u1ea1c nh\u01b0 \u0111\u00e1 qu\u00fd c\u1ea7n m\u00e0i d\u0169a", "sex": 5}
{"first_name": "Nh\u1ea5t Th\u1ea1ch", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, \"Nh\u1ea5t\" c\u00f3 ngh\u0129a l\u00e0 m\u1ed9t, th\u1ee9 nh\u1ea5t, \u0111\u1ea7u ti\u00ean, th\u1ec3 hi\u1ec7n s\u1ef1 b\u1eadc nh\u1ea5t, \u0111\u1ee9ng \u0111\u1ea7u. \"Th\u1ea1ch\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u00e1, t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 c\u1ee9ng c\u00e1p, ki\u00ean \u0111\u1ecbnh. \u0110\u1eb7t con t\u00ean \"Nh\u1ea5t Th\u1ea1ch\" l\u00e0 mong con sau n\u00e0y l\u00e0 ng\u01b0\u1eddi m\u1ea1nh m\u1ebd, ki\u00ean \u0111\u1ecbnh, c\u00f3 th\u1ec3 l\u00e0 ch\u1ed7 d\u1ef1a v\u1eefng ch\u1eafc cho ng\u01b0\u1eddi th\u00e2n v\u00e0 gia \u0111\u00ecnh", "sex": 3}
{"first_name": "Quang Th\u1ea1ch", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, Quang c\u00f3 ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, Th\u1ea1ch c\u00f3 ngh\u0129a l\u00e0 \u0111\u00e1. T\u00ean Quang Th\u1ea1ch l\u00e0m ta li\u00ean t\u01b0\u1edfng \u0111\u1ebfn \u00e1nh s\u00e1ng ph\u00e1t ra t\u1eeb nh\u1eefng vi\u00ean \u0111\u00e1 qu\u00fd, t\u00ean n\u00e0y d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, s\u00e1ng su\u1ed1t, c\u00f3 t\u00e0i n\u0103ng, ki\u00ean \u0111\u1ecbnh, m\u1ea1nh m\u1ebd", "sex": 3}
{"first_name": "Th\u00e1i Th\u1ea1ch", "meaning": "\"Th\u00e1i\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 hanh th\u00f4ng, thu\u1eadn l\u1ee3i, ch\u1ec9 s\u1ef1 y\u00ean vui, b\u00ecnh y\u00ean, th\u01b0 th\u00e1i. \"Th\u1ea1ch\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u00e1, t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 ki\u00ean \u0111\u1ecbnh, kh\u00f4ng d\u1ec5 lay \u0111\u1ed9ng. \"Th\u00e1i Th\u1ea1ch\" khi\u1ebfn ng\u01b0\u1eddi ta li\u00ean t\u01b0\u1edfng \u0111\u1ebfn h\u00ecnh \u1ea3nh nh\u1eefng h\u00f2n \u0111\u00e3 l\u1edbn hi\u00ean ngang, kh\u00f4ng b\u1ecb lay \u0111\u1ed9ng trong m\u1ecdi ho\u00e0n c\u1ea3nh, b\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n th\u1ec3 hi\u1ec7n s\u1ef1 th\u01b0 th\u00e1i, b\u00ecnh y\u00ean. \u0110\u1eb7t con t\u00ean \"Th\u00e1i Th\u1ea1ch\" l\u00e0 mong con m\u1ea1nh m\u1ebd, s\u1ed1ng ki\u00ean \u0111\u1ecbnh, c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean vui v\u1ebb, t\u00e2m h\u1ed3n l\u1ea1c quan, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean", "sex": 3}
{"first_name": "Tu\u1ea5n Th\u1ea1ch", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Tu\u1ea5n\" c\u00f3 ngh\u0129a l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, t\u00e0i tr\u00ed v\u01b0\u1ee3t b\u1eadc. \"Th\u1ea1ch\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u00e1, t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 v\u1eefng ch\u1eafc v\u00e0 trung th\u00e0nh. V\u00ec v\u1eady t\u00ean \"Tu\u1ea5n Th\u1ea1ch\"  \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ch\u00e0ng trai c\u00f3 di\u1ec7n m\u1ea1o tu\u1ea5n t\u00fa, \u0111a t\u00e0i, c\u00f3 b\u1ea3n l\u0129nh, l\u1eadp tr\u01b0\u1eddng v\u00e0 c\u00f3 kh\u00ed ph\u00e1ch", "sex": 3}
{"first_name": "V\u00e2n Th\u1ea1ch", "meaning": "V\u00e2n theo ngh\u0129a H\u00e1n vi\u1ec7t l\u00e0 m\u00e2y, g\u1ee3i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0 \u0111\u00e1m m\u00e2y tr\u1eafng b\u1ed3ng b\u1ec1nh tr\u00ean tr\u1eddi. \"Th\u1ea1ch\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u00e1, n\u00f3i \u0111\u1ebfn nh\u1eefng c\u00f3 t\u00ednh ch\u1ea5t ki\u00ean c\u1ed1, c\u1ee9ng c\u00e1p. C\u00e1i t\u00ean mang nh\u1eb9 nh\u00e0ng, g\u1ea7n g\u0169i v\u1edbi thi\u00ean nhi\u00ean, \"V\u00e2n Th\u1ea1ch\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi xinh \u0111\u1eb9p, th\u00e2n thi\u1ec7n, d\u1ecbu d\u00e0ng, b\u00ecnh d\u1ecb nh\u01b0ng c\u0169ng c\u00f3 kh\u00ed ph\u00e1ch, b\u1ea3n l\u0129nh, m\u1ea1nh m\u1ebd tr\u01b0\u1edbc m\u1ecdi th\u00e1ch th\u1ee9c", "sex": 5}
{"first_name": "Y\u00ean Th\u1ea1ch", "meaning": "Th\u1ea1ch c\u00f3 ngh\u0129a l\u00e0 \u0111\u00e1, n\u00f3i \u0111\u1ebfn nh\u1eefng c\u00f3 t\u00ednh ch\u1ea5t ki\u00ean c\u1ed1, c\u1ee9ng c\u00e1p. T\u1ef1a nh\u01b0 \u0111\u00e1, ng\u01b0\u1eddi t\u00ean \"Th\u1ea1ch\" th\u01b0\u1eddng c\u00f3 th\u1ec3 ch\u1ea5t kh\u1ecfe m\u1ea1nh, \u00fd ch\u00ed ki\u00ean c\u01b0\u1eddng. Th\u1ea1ch Y\u00ean con l\u00e0 ng\u01b0\u1eddi m\u1ea1nh m\u1ebd c\u00f3 th\u1ec3 ch\u1ea5t kh\u1ecfe suy ngh\u0129 c\u1ee7a con ch\u00ednh ch\u1eafn \u00edt b\u1ecb giao \u0111\u1ed9ng v\u00e0 ng\u01b0\u1eddi c\u00f3 ch\u00ed h\u01b0\u1edbng v\u00e0 quy\u1ebft t\u00e2m l\u1edbn.", "sex": 5}
{"first_name": "Ng\u1ecdc T\u1ec1", "meaning": "\"Ng\u1ecdc\" l\u00e0 \u0111\u00e1 qu\u00fd. \"Ng\u1ecdc T\u1ec1\" l\u00e0 m\u00e0i gi\u0169a ng\u1ecdc \u0111\u1ec1u nhau, h\u00e0m \u00fd ng\u01b0\u1eddi chuy\u00ean c\u1ea7n nh\u1eabn n\u1ea1i, ch\u00fa m\u1ee5c quy\u1ebft t\u00e2m, th\u1ec3 hi\u1ec7n n\u0103ng l\u1ef1c kh\u00f4ng ng\u1eebng.", "sex": 3}
{"first_name": "Thanh Ki\u00ean", "meaning": "\"Thanh\" c\u00f3 ngh\u0129a l\u00e0 m\u00e0u xanh, tu\u1ed5i tr\u1ebb, c\u00f2n l\u00e0 s\u1ef1 thanh cao, n\u0103ng \u0111\u1ed9ng. Thanh Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi nh\u1ea1y b\u00e9n, lu\u00f4n t\u00ecm t\u00f2i nh\u1eefng \u0111i\u1ec1u m\u1edbi m\u1ebb, s\u00e1ng d\u1ea1, tr\u1ebb trung, r\u1ea5t n\u0103ng n\u1ed5, c\u00f3 ti\u1ec1n t\u00e0i trong t\u01b0\u01a1ng lai", "sex": 3}
{"first_name": "Th\u1ea3o Ki\u00ean", "meaning": "\"Th\u1ea3o\" c\u00f3 ngh\u0129a l\u00e0 c\u1ecf, m\u1ed9t lo\u1ea1i th\u1ef1c v\u1eadt g\u1eafn li\u1ec1n v\u1edbi thi\u00ean nhi\u00ean v\u00e0 cu\u1ed9c s\u1ed1ng. Th\u1ea3o Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi hi\u1ec1n th\u1ee5c, \u0111oan trang, c\u00f3 v\u1ebb ngo\u00e0i d\u1ecbu d\u00e0ng, mong manh, b\u00ecnh d\u1ecb nh\u01b0ng c\u0169ng r\u1ea5t m\u1ea1nh m\u1ebd, c\u00f3 kh\u1ea3 n\u0103ng sinh t\u1ed3n cao", "sex": 5}
{"first_name": "Th\u1ebf Ki\u00ean", "meaning": "\"Th\u1ebf\" c\u00f3 ngh\u0129a l\u00e0 quy\u1ec1n l\u1ef1c, s\u1ee9c m\u1ea1nh, uy l\u1ef1c. Th\u1ebf Ki\u00ean, \u00fd cha m\u1eb9 mong mu\u1ed1n con c\u00e1i sau n\u00e0y th\u00e0nh c\u00f4ng, ch\u1ee9c cao v\u1ecdng tr\u1ecdng, l\u00e0 ng\u01b0\u1eddi t\u00e0i ba, gi\u1ecfi giang, n\u1eafm quy\u1ec1n l\u1ef1c, t\u00e0i gi\u1ecfi v\u00e0 c\u00f3 quy\u1ec1n l\u1ef1c trong tay", "sex": 3}
{"first_name": "Thi\u00ean Ki\u00ean", "meaning": "\"Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eddi, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. Thi\u00ean Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi t\u00e0i gi\u1ecfi c\u00f3 t\u1ea7m nh\u00ecn xa tr\u00f4ng r\u1ed9ng, bi\u1ebft suy ngh\u0129 tr\u01b0\u1edbc sau, l\u00e0 ng\u01b0\u1eddi c\u00f3 \u0111\u1ecba v\u1ecb trong x\u00e3 h\u1ed9i", "sex": 7}
{"first_name": "Thi\u1ec7n Ki\u00ean", "meaning": "\"Thi\u1ec7n\" l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 khen ng\u1ee3i nh\u1eefng con ng\u01b0\u1eddi c\u00f3 ph\u1ea9m ch\u1ea5t hi\u1ec1n l\u00e0nh,l\u01b0\u01a1ng thi\u1ec7n. Thi\u1ec7n Ki\u00ean, \u00fd ch\u1ec9 ng\u01b0\u1eddi r\u1eafn r\u1ecfi, ki\u00ean \u0111\u1ecbnh, lu\u00f4n h\u01b0\u1edbng thi\u1ec7n, tu t\u00e2m t\u00edch \u0111\u1ee9c, y\u00eau th\u01b0\u01a1ng m\u1ecdi ng\u01b0\u1eddi xung quanh.", "sex": 3}
{"first_name": "Thu Ki\u00ean", "meaning": "\"Thu Ki\u00ean\" cha m\u1eb9 mong mu\u1ed1n con c\u00e1i sau n\u00e0y v\u1eefng v\u00e0ng, t\u1ef1 l\u1eadp, m\u1ea1nh m\u1ebd, v\u00e0 trong s\u00e1ng, xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau nh\u01b0 kh\u00ed tr\u1eddi m\u00f9a thu, g\u1eb7p \u0111\u01b0\u1ee3c nhi\u1ec1u may m\u1eafn trong cu\u1ed9c s\u1ed1ng", "sex": 5}
{"first_name": "Thu\u1eadn Ki\u00ean", "meaning": "\"Thu\u1eadn\" c\u00f3 ngh\u0129a l\u00e0 noi theo, l\u00e0 h\u00f2a thu\u1eadn, hi\u1ebfu thu\u1eadn. Thu\u1eadn Ki\u00ean, \u00fd n\u00f3i m\u1ed9t ng\u01b0\u1eddi hi\u1ebfu th\u1ea3o, lu\u00f4n bi\u1ebft ph\u1ea5n \u0111\u1ea5u trong cu\u1ed9c \u0111\u1eddi, c\u00f3 suy ngh\u0129 s\u00e2u s\u1eafc, cu\u1ed9c \u0111\u1eddi s\u1ebd thu\u1eadn bu\u1ed3m, may m\u1eafn", "sex": 3}
{"first_name": "Th\u1ee5c Ki\u00ean", "meaning": "\"Th\u1ee5c\" c\u00f3 ngh\u0129a l\u00e0 th\u00e0nh th\u1ea1o, thu\u1ea7n th\u1ee5c, n\u00f3i v\u1ec1 nh\u1eefng th\u1ee9 \u0111\u00e3 quen thu\u1ed9c. Th\u1ee5c Ki\u00ean, \u00fd cha m\u1eb9 mong mu\u1ed1n con c\u00f3 \u0111\u01b0\u1ee3c t\u00ednh ki\u00ean c\u01b0\u1eddng, ch\u0103m ch\u1ec9, tinh t\u1ebf, l\u00e0m g\u00ec c\u0169ng ch\u00fa t\u00e2m ho\u00e0n th\u00e0nh t\u1ed1t", "sex": 5}
{"first_name": "Th\u00fay Ki\u00ean", "meaning": "\"Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn vi\u00ean ng\u1ecdc \u0111\u1eb9p, ng\u1ecdc qu\u00fd. Th\u00fay Ki\u00ean, v\u1edbi mong mu\u1ed1n con s\u1ebd lu\u00f4n xinh \u0111\u1eb9p, quy\u1ec1n qu\u00fd, \u0111\u01b0\u1ee3c tr\u00e2n tr\u1ecdng v\u00e0 n\u00e2ng niu, c\u00f3 t\u00ednh ki\u00ean \u0111\u1ecbnh, s\u00e2u s\u1eafc, m\u1ea1nh m\u1ebd", "sex": 5}
{"first_name": "Th\u00f9y Ki\u00ean", "meaning": "\"Th\u00f9y Ki\u00ean\" cha m\u1eb9 mong mu\u1ed1n con c\u00e1i t\u00e0i s\u1eafc v\u1eb9n to\u00e0n, d\u1ecbu d\u00e0ng, \u0111\u00e1ng y\u00eau. Cu\u1ed9c \u0111\u1eddi con c\u0169ng nh\u1eb9 nh\u00e0ng nh\u01b0 t\u00ednh c\u00e1ch c\u1ee7a con v\u1eady", "sex": 5}
{"first_name": "Th\u1ee7y Ki\u00ean", "meaning": "\"Th\u1ee7y Ki\u00ean\" \u00fd n\u00f3i v\u1ec1 ng\u01b0\u1eddi con g\u00e1i l\u00fac t\u0129nh l\u1eb7ng, th\u00e2m tr\u1ea7m, nh\u01b0ng c\u0169ng c\u00f3 khi d\u1eef d\u1ed9i, m\u00e3nh li\u1ec7t, c\u00f3 t\u00ednh nhu c\u01b0\u01a1ng r\u00f5 r\u00e0ng, m\u1ed9t con ng\u01b0\u1eddi c\u00f3 s\u1ef1 suy ngh\u0129 s\u00e2u s\u1eafc", "sex": 5}
{"first_name": "Ti\u1ebfn Ki\u00ean", "meaning": "\"Ti\u1ebfn\" theo ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 s\u1ef1 v\u01b0\u01a1n t\u1edbi th\u1ec3 hi\u1ec7n \u00fd ch\u00ed n\u1ed7 l\u1ef1c c\u1ee7a con ng\u01b0\u1eddi. Ti\u1ebfn Ki\u00ean, \u00fd cha m\u1eb9 mong mu\u1ed1n con c\u00e1i t\u1ef1 l\u1ef1c t\u1ef1 c\u01b0\u1eddng, lu\u00f4n th\u00e0nh c\u00f4ng, ti\u1ebfn b\u01b0\u1edbc tr\u00ean \u0111\u01b0\u1eddng \u0111\u1eddi", "sex": 3}
{"first_name": "Ti\u1ec3u Ki\u00ean", "meaning": "\"Ti\u1ec3u\" trong t\u1eeb ti\u1ec3u th\u01b0, \u00fd n\u00f3i s\u1ef1 quy\u1ec1n qu\u00fd,cao sang, bao b\u1ecdc. Ti\u1ec3u Ki\u00ean, ng\u1ee5 \u00fd cha m\u1eb9 mu\u1ed1n con c\u00e1i c\u1ee7a m\u00ecnh lu\u00f4n \u0111\u01b0\u1ee3c tr\u00e0n \u0111\u1ea7y y\u00eau th\u01b0\u01a1ng, s\u1ed1ng sung t\u00fac, th\u1ec3 hi\u1ec7n s\u1ef1 quy\u1ec1n qu\u00fd, c\u00f3 v\u1ecb th\u1ebf trong x\u00e3 h\u1ed9i", "sex": 5}
{"first_name": "T\u00edn Ki\u00ean", "meaning": "\"T\u00edn\" c\u00f3 ngh\u0129a l\u00e0 l\u00f2ng th\u00e0nh th\u1ef1c, hay \u0111\u1ee9c t\u00ednh th\u1ee7y chung. T\u00edn Ki\u00ean, th\u1ec3 hi\u1ec7n m\u1ed9t ng\u01b0\u1eddi coi tr\u1ecdng l\u1eddi n\u00f3i, s\u1ed1ng c\u00f3 \u0111\u1ea1o ngh\u0129a, c\u00f3 tr\u01b0\u1edbc c\u00f3 sau, m\u1ed9t ng\u01b0\u1eddi \u0111\u00e1ng tin c\u1eady, n\u1ec3 tr\u1ecdng", "sex": 3}
{"first_name": "To\u00e0n Ki\u00ean", "meaning": "\"To\u00e0n\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ea7y \u0111\u1ee7, tr\u1ecdn v\u1eb9n, kh\u00f4ng thi\u1ebfu s\u00f3t. To\u00e0n Ki\u00ean, \u00fd mu\u1ed1n con c\u00e1i sau n\u00e0y s\u1ebd lu\u00f4n nh\u1eadn \u0111\u01b0\u1ee3c nh\u1eefng ni\u1ec1m vui, may m\u1eafn m\u1ed9t c\u00e1ch tr\u1ecdn v\u1eb9n, sung t\u00fac \u0111\u1ea7y \u0111\u1ee7 nh\u1ea5t, m\u1ecdi \u0111i\u1ec1u \u0111\u1ec1u su\u00f4n s\u1ebb, song to\u00e0n", "sex": 3}
{"first_name": "Tr\u00e2m Ki\u00ean", "meaning": "T\u00ean \"Tr\u00e2m Ki\u00ean\" \u00fd cha m\u1eb9 mong mu\u1ed1n con g\u00e1i v\u1eeba d\u1ecbu d\u00e0ng, th\u00f4ng minh, l\u1ea1i s\u1eafc s\u1ea3o v\u00e0 hi\u1ec3u bi\u1ebft, suy ngh\u0129 ch\u00edn ch\u1eafn, sang tr\u1ecdng, qu\u00fd ph\u00e1i", "sex": 5}
{"first_name": "Tr\u00e2n Ki\u00ean", "meaning": "\"Tr\u00e2n\" c\u00f3 ngh\u0129a l\u00e0 b\u00e1u, qu\u00fd, hi\u1ebfm c\u00f3, qu\u00fd tr\u1ecdng, coi tr\u1ecdng. Tr\u00e2n Ki\u00ean, \u00fd cha m\u1eb9 mong mu\u1ed1n con c\u00e1i xinh \u0111\u1eb9p, t\u01b0 duy; c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac, gi\u00e0u sang, \u0111\u01b0\u1ee3c y\u00eau th\u01b0\u01a1ng, nu\u00f4ng chi\u1ec1u.", "sex": 5}
{"first_name": "Trang Ki\u00ean", "meaning": "T\u00ean \"Trang Ki\u00ean\" \u00fd cha m\u1eb9 mong mu\u1ed1n con g\u00e1i d\u1ecbu d\u00e0ng, tao nh\u00e3, lu\u00f4n gi\u1eef \u0111\u01b0\u1ee3c s\u1ef1 chu\u1ea9n m\u1ef1c v\u00e0 qu\u00fd ph\u00e1i, n\u1ebft na m\u00e0 nh\u01b0ng v\u1eabn ph\u1ea3i m\u1ea1nh m\u1ebd gi\u1ecfi giang", "sex": 5}
{"first_name": "Tri\u1ec1u Ki\u00ean", "meaning": "\"Tri\u1ec1u\" \u00fd ch\u1ec9 n\u01b0\u1edbc; nh\u1eefng ng\u01b0\u1eddi m\u1ea1nh m\u1ebd, ki\u00ean c\u01b0\u1eddng, c\u00f3 l\u1eadp tr\u01b0\u1eddng. Tri\u1ec1u Ki\u00ean, th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 b\u1ea3n l\u0129nh, s\u1eafc v\u00f3c, c\u00f3 t\u1ea7m nh\u00ecn, ki\u00ean \u0111\u1ecbnh trong \u00fd ch\u00ed, l\u00e0 m\u1ed9t ng\u01b0\u1eddi t\u00e0i gi\u1ecfi trong t\u01b0\u01a1ng lai", "sex": 3}
{"first_name": "Tri\u1ec7u Ki\u00ean", "meaning": "\"Tri\u1ec7u\" n\u00f3i v\u1ec1 m\u1ed9t s\u1ef1 b\u1eaft \u0111\u1ea7u, kh\u1edfi \u0111\u1ea7u. Tri\u1ec7u Ki\u00ean, \u00fd cha m\u1eb9 mong mu\u1ed1n con s\u1ebd t\u1ea1o n\u00ean m\u1ed9t s\u1ef1 kh\u1edfi \u0111\u1ea7u m\u1edbi m\u1ebb t\u1ed1t l\u00e0nh cho gia \u0111\u00ecnh. C\u00f3 ch\u00ed t\u1ef1 l\u1ef1c t\u1ef1 c\u01b0\u1eddng, bi\u1ebft ph\u1ea5n \u0111\u1ea5u, l\u00e0m n\u00ean cu\u1ed9c s\u1ed1ng gi\u00e0u sang, ph\u00fa qu\u00fd.", "sex": 7}
{"first_name": "Tr\u1ecdng Ki\u00ean", "meaning": "\"Tr\u1ecdng\" l\u00e0 ng\u01b0\u1eddi bi\u1ebft qu\u00fd tr\u1ecdng l\u1ebd ph\u1ea3i, s\u1ed1ng \u0111\u1ea1o l\u00fd, \u0111\u1ee9ng \u0111\u1eafn, lu\u00f4n ch\u1ecdn con \u0111\u01b0\u1eddng ngay th\u1eb3ng. Tr\u1ecdng Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi c\u00f3 c\u1ed1t c\u00e1ch thanh cao, nghi\u00eam t\u00fac, s\u1ed1ng c\u00f3 \u0111\u1ea1o l\u00fd, c\u00f3 t\u00ecnh ngh\u0129a", "sex": 3}
{"first_name": "Tr\u00fac Ki\u00ean", "meaning": "\"Tr\u00fac\" l\u00e0 m\u1ed9t bi\u1ec3u t\u01b0\u1ee3ng cho kh\u00ed ch\u1ea5t thanh cao c\u1ee7a con ng\u01b0\u1eddi. Tr\u00fac Ki\u00ean, \u00fd mu\u1ed1n n\u00f3i ng\u01b0\u1eddi c\u00f3 suy ngh\u0129 s\u00e2u xa, s\u1eafc b\u00e9n, lu\u00f4n h\u1ecdc h\u1ecfi, t\u00ecm t\u00f2i, m\u1edf mang ki\u1ebfn th\u1ee9c, t\u00e2m h\u1ed3n an nhi\u00ean, t\u1ef1 t\u1ea1i, kh\u00f4ng ch\u1ea1y theo quy\u1ec1n v\u1ecb, v\u1eadt ch\u1ea5t.", "sex": 7}
{"first_name": "T\u00fa Ki\u00ean", "meaning": "\"T\u00fa\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t l\u00e0 ng\u00f4i sao, v\u00ec tinh t\u00fa l\u1ea5p l\u00e1nh chi\u1ebfu s\u00e1ng tr\u00ean cao. T\u00fa Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi con g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, h\u1ecdc v\u1ea5n uy\u00ean th\u00e2m, gi\u1ecfi giang, t\u00e0i s\u1eafc v\u1eb9n to\u00e0n", "sex": 5}
{"first_name": "Tu\u1ea5n Ki\u00ean", "meaning": "\"Tu\u1ea5n\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, t\u00e0i tr\u00ed, t\u00e0i ba. Tu\u1ea5n Ki\u00ean, th\u1ec3 hi\u1ec7n di\u1ec7n m\u1ea1o c\u1ee7a m\u1ed9t ng\u01b0\u1eddi tu\u1ea5n t\u00fa, kh\u00f4i ng\u00f4, th\u00e2n thi\u1ec7n v\u1edbi m\u1ecdi ng\u01b0\u1eddi, vui v\u1ebb, h\u00f2a \u0111\u1ed3ng", "sex": 3}
{"first_name": "Tu\u1ec7 Ki\u00ean", "meaning": "\"Tu\u1ec7\" c\u00f3 ngh\u0129a l\u00e0 tr\u00ed th\u00f4ng minh, t\u00e0i tr\u00ed, nh\u1ea1y b\u00e9n. Tu\u1ec7 Ki\u00ean, l\u00e0 m\u1ed9t ng\u01b0\u1eddi gi\u1ecfi giang, t\u00e0i ba, c\u00f3 tr\u00ed tu\u1ec7, c\u00f3 n\u0103ng l\u1ef1c, t\u01b0 duy, kh\u00f4n lanh. Cha m\u1eb9 \u0111\u1eb7t t\u00ean n\u00e0y mong mu\u1ed1n con c\u00e1i th\u00f4ng minh, \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi bi\u1ebft \u0111\u1ebfn", "sex": 7}
{"first_name": "T\u00f9ng Ki\u00ean", "meaning": "\"T\u00f9ng\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i c\u00e2y trong b\u1ed9 c\u00e2y t\u1ee9 qu\u00fd, \u1edf Vi\u1ec7t Nam c\u00f2n g\u1ecdi l\u00e0 c\u00e2y th\u00f4ng, sinh tr\u01b0\u1edfng trong \u0111i\u1ec1u ki\u1ec7n kh\u1eafc nghi\u1ec7t m\u00e0 v\u1eabn xanh \u01b0\u01a1m, b\u1ea5t khu\u1ea5t. T\u00f9ng Ki\u00ean, \u00fd mu\u1ed1n n\u00f3i ng\u01b0\u1eddi qu\u00e2n t\u1eed, s\u1ed1ng hi\u00eang ngang, ki\u00ean c\u01b0\u1eddng, v\u1eefng ch\u00e3i trong s\u01b0\u01a1ng gi\u00f3, n\u1eafng m\u01b0a; l\u00e0 ng\u01b0\u1eddi ki\u00ean \u0111\u1ecbnh, d\u00e1m ngh\u0129 d\u00e1m l\u00e0m, s\u1ed1ng c\u00f3 m\u1ee5c \u0111\u00edch, l\u00fd t\u01b0\u1edfng.", "sex": 3}
{"first_name": "Tuy\u1ebft Ki\u00ean", "meaning": "\"Tuy\u1ebft\" l\u00e0 tinh th\u1ec3 b\u0103ng nh\u1ecf v\u00e0 tr\u1eafng k\u1ebft tinh th\u00e0nh kh\u1ed1i x\u1ed1p, nh\u1eb9, r\u01a1i \u1edf v\u00f9ng c\u00f3 kh\u00ed h\u1eadu l\u1ea1nh. Tuy\u1ebft Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, trong tr\u1eafng, tinh kh\u00f4i, m\u1ea1nh m\u1ebd, c\u1ee9ng r\u1eafn, thanh cao v\u00e0 quy\u1ec1n qu\u00fd nh\u01b0 nh\u1eefng b\u00f4ng hoa tuy\u1ebft", "sex": 5}
{"first_name": "V\u00e2n Ki\u00ean", "meaning": "\"V\u00e2n\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 m\u00e2y, g\u1ee3i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng, bay b\u1ed5ng. V\u00e2n Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi con g\u00e1i th\u00f9y m\u1ecb, gi\u1ea3n d\u1ecb t\u1eeb c\u1ed1t c\u00e1ch, c\u00f3 t\u00ednh \u0111\u1ed9c l\u1eadp cao, ph\u00e1t tri\u1ec3n b\u1ea3n th\u00e2n, c\u00f3 t\u1ea7m nh\u00ecn xa, ti\u1ebfn b\u1ed9", "sex": 5}
{"first_name": "V\u0103n Ki\u00ean", "meaning": "\"V\u0103n\" \u00fd n\u00f3i m\u1ed9t con ng\u01b0\u1eddi nho nh\u00e3, h\u1ecdc th\u1ee9c cao, ki\u1ebfn th\u1ee9c uy\u00ean th\u00e2m. V\u0103n Ki\u00ean, th\u1ec3 hi\u1ec7n m\u1ed9t ng\u01b0\u1eddi c\u00f3 tr\u00ecnh \u0111\u1ed9 h\u1ecdc th\u1ee9c, suy ngh\u0129 s\u00e2u xa, bi\u1ebft nh\u00ecn xa tr\u00f4ng r\u1ed9ng, s\u1ebd l\u00e0 m\u1ed9t nh\u00e0 l\u00e3nh \u0111\u1ea1o t\u1ed1t trong t\u01b0\u01a1ng lai", "sex": 3}
{"first_name": "Vi\u1ebft Ki\u00ean", "meaning": "\"Vi\u1ebft\" ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 n\u00f3i ra, \u0111\u01b0a ra, h\u00e0m ngh\u0129a h\u00e0nh \u0111\u1ed9ng c\u00f3 l\u1eadp lu\u1eadn. Vi\u1ebft Ki\u00ean, \u00fd n\u00f3i ng\u01b0\u1eddi n\u1eafm quy\u1ec1n, c\u00f3 s\u1ee9c m\u1ea1nh t\u1eeb l\u1eddi n\u00f3i, c\u1eed ch\u1ec9, ng\u01b0\u1eddi c\u00f3 \u0111\u1ea1o t\u1ed1t, c\u00f3 tri th\u1ee9c, gi\u1ecfi giang, \u0111\u00e1ng tin c\u1eady", "sex": 3}
{"first_name": "Vi\u1ec7t Ki\u00ean", "meaning": "\"Vi\u1ec7t\" \u00fd ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi th\u00f4ng minh, y\u00eau n\u01b0\u1edbc, \u01b0u vi\u1ec7t. Vi\u1ec7t Ki\u00ean, th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 m\u1ed9t s\u1ee9c m\u1ea1nh ki\u00ean \u0111\u1ecbnh t\u1eeb b\u00ean trong, suy ngh\u0129 s\u00e1ng su\u1ed1t, \u0111\u01b0a ra nh\u1eefng nh\u1eadn \u0111\u1ecbnh \u0111\u00fang, ki\u00ean c\u01b0\u1eddng, b\u1ea5t khu\u1ea5t, l\u00e0 ng\u01b0\u1eddi c\u00f3 t\u00e0i n\u0103ng xu\u1ea5t ch\u00fang", "sex": 3}
{"first_name": "V\u00f5 Ki\u00ean", "meaning": "\"V\u00f5 Ki\u00ean\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho ng\u01b0\u1eddi con trai v\u1edbi mong mu\u1ed1n con lu\u00f4n c\u00f3 \u0111\u01b0\u1ee3c kh\u00ed ch\u1ea5t h\u00f9ng d\u0169ng, c\u00f3 s\u1ee9c kh\u1ecfe v\u00e0 tinh th\u1ea7n m\u1ea1nh m\u1ebd, c\u00f3 th\u1ec3 \u0111\u01b0\u01a1ng \u0111\u1ea7u m\u1ecdi th\u1eed th\u00e1ch", "sex": 3}
{"first_name": "V\u0169 Ki\u00ean", "meaning": "\"V\u0169\" c\u00f3 ngh\u0129a l\u00e0 m\u01b0a, l\u00e0 kh\u00fac nh\u1ea1c, s\u1ee9c m\u1ea1nh to l\u1edbn. V\u0169 Ki\u00ean, ch\u1ec9 ng\u01b0\u1eddi c\u00f3 ho\u00e0i b\u00e3o l\u1edbn, suy ngh\u0129 s\u00e2u xa, lu\u00f4n c\u00f3 ch\u00ed c\u1ea7u ti\u1ebfn, ph\u00e1t tri\u1ec3n b\u1ea3n th\u00e2n, th\u00e0nh c\u00f4ng trong s\u1ef1 nghi\u1ec7p", "sex": 3}
{"first_name": "Xu\u00e2n Ki\u00ean", "meaning": "\"Xu\u00e2n\" l\u00e0 ng\u01b0\u1eddi lanh l\u1ee3i, \u0111\u1ea1i c\u00e1t, c\u00f3 s\u1ee9c s\u1ed1ng nh\u01b0 m\u00f9a xu\u00e2n. Xu\u00e2n Ki\u00ean, \u00fd n\u00f3i m\u1ed9t ng\u01b0\u1eddi lu\u00f4n tr\u00e0n \u0111\u1ea7y nhi\u1ec7t huy\u1ebft, lu\u00f4n bi\u1ebft ph\u1ea5n \u0111\u1ea5u, trau d\u1ed3i b\u1ea3n th\u00e2n, g\u1eb7t h\u00e1i th\u00e0nh c\u00f4ng", "sex": 7}
{"first_name": "Minh Th\u1ea9m", "meaning": "\"Minh\" l\u00e0 s\u00e1ng t\u1ecf. \"Minh Th\u1ea9m\" l\u00e0 tra x\u00e9t t\u1ecf t\u01b0\u1eddng, ch\u1ec9 con ng\u01b0\u1eddi th\u1eadn tr\u1ecdng nghi\u00eam t\u00fac, c\u00f3 hi\u1ec3u bi\u1ebft tr\u00ed tu\u1ec7.", "sex": 3}
{"first_name": "\u00c1i Duy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\u00c1i\" c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. \"Duy\u00ean\" ngh\u0129a l\u00e0 s\u1ef1 h\u00e0i ho\u00e0 c\u1ee7a m\u1ed9t s\u1ed1 n\u00e9t t\u1ebf nh\u1ecb, \u0111\u00e1ng y\u00eau, t\u1ea1o n\u00ean v\u1ebb h\u1ea5p d\u1eabn t\u1ef1 nhi\u00ean c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \"\u00c1i Duy\u00ean\" con l\u00e0 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a v\u00e0 \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau m\u1ebfn.", "sex": 5}
