{"first_name": "\u00c1nh Duy\u00ean", "meaning": "\u00c1nh l\u00e0 tia s\u00e1ng. \u00c1nh Duy\u00ean h\u00e0m ngh\u0129a con ng\u01b0\u1eddi may m\u1eafn, c\u00f3 cu\u1ed9c s\u1ed1ng t\u1ed1t \u0111\u1eb9p, \u0111\u1ea7y nh\u1eefng b\u1ea5t ng\u1edd", "sex": 5}
{"first_name": "B\u1ea3o Duy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"B\u1ea3o\" th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. \"Duy\u00ean\" ngh\u0129a l\u00e0 s\u1ef1 h\u00e0i ho\u00e0 c\u1ee7a m\u1ed9t s\u1ed1 n\u00e9t t\u1ebf nh\u1ecb, \u0111\u00e1ng y\u00eau, t\u1ea1o n\u00ean v\u1ebb h\u1ea5p d\u1eabn t\u1ef1 nhi\u00ean c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \"B\u1ea3o Duy\u00ean\" mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, v\u00e0 l\u00e0 b\u1ea3o v\u1eadt b\u1ea3o b\u1ed1i qu\u00fd gi\u00e1 nh\u1ea5t c\u1ee7a ba m\u1eb9.", "sex": 5}
{"first_name": "B\u00edch Duy\u00ean", "meaning": "\"Con g\u00e1i l\u00e0 h\u00f2n \u0111\u00e1 qu\u00fd m\u00e0u xanh bi\u1ebfc \u1ea9n ch\u1ee9a nh\u1eefng n\u00e9t huy\u1ec1n \u1ea3o \u0111\u1ed9c \u0111\u00e1o. C\u0169ng nh\u01b0 vi\u00ean ng\u1ecdc \u1ea5y, con lu\u00f4n ch\u1ee9a \u0111\u1ef1ng n\u00e9t duy\u00ean th\u1ea7m kh\u00f3 n\u00f3i. \u0110\u00f3 l\u00e0 n\u00e9t \u0111\u1eb9p d\u1ecbu d\u00e0ng, tao nh\u00e3 v\u00e0 thanh l\u1ecbch.\r\n\"", "sex": 5}
{"first_name": "H\u00e0 Duy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"H\u00e0\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi m\u1ec1m m\u1ea1i, hi\u1ec1n h\u00f2a nh\u01b0 con s\u00f4ng. \"Duy\u00ean\" ngh\u0129a l\u00e0 s\u1ef1 h\u00e0i ho\u00e0 c\u1ee7a m\u1ed9t s\u1ed1 n\u00e9t t\u1ebf nh\u1ecb, \u0111\u00e1ng y\u00eau, t\u1ea1o n\u00ean v\u1ebb h\u1ea5p d\u1eabn t\u1ef1 nhi\u00ean c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \"H\u00e0 Duy\u00ean\" mong mu\u1ed1n con xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, \u0111\u1eb1m th\u1eafm, nh\u1eb9 nh\u00e0ng nh\u01b0 d\u00f2ng s\u00f4ng hi\u1ec1n h\u00f2a.", "sex": 5}
{"first_name": "H\u1ea1 Duy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"H\u1ea1\" c\u00f2n \u0111\u01b0\u1ee3c hi\u1ec3u l\u00e0 s\u1ef1 an nh\u00e0n, r\u00e3nh r\u1ed7i, ch\u1ec9 s\u1ef1 th\u01b0 th\u00e1i.\"Duy\u00ean\" ngh\u0129a l\u00e0 s\u1ef1 h\u00e0i ho\u00e0 c\u1ee7a m\u1ed9t s\u1ed1 n\u00e9t t\u1ebf nh\u1ecb \u0111\u00e1ng y\u00eau t\u1ea1o n\u00ean v\u1ebb h\u1ea5p d\u1eabn t\u1ef1 nhi\u00ean c\u1ee7a ng\u01b0\u1eddi con g\u00e1i.\"H\u1ea1 Duy\u00ean\" mong mu\u1ed1n con lu\u00f4n xinh t\u01b0\u01a1i duy\u00ean d\u00e1ng v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng an l\u00e0nh, nh\u00e0n h\u1ea1.", "sex": 5}
{"first_name": "H\u00e0n Duy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"H\u00e0n c\u00f3 ngh\u0129a l\u00e0 k\u1ebft n\u1ed1i, g\u1eafn k\u1ebft.\"Duy\u00ean\" ngh\u0129a l\u00e0 s\u1ef1 h\u00e0i ho\u00e0 c\u1ee7a m\u1ed9t s\u1ed1 n\u00e9t t\u1ebf nh\u1ecb \u0111\u00e1ng y\u00eau t\u1ea1o n\u00ean v\u1ebb h\u1ea5p d\u1eabn t\u1ef1 nhi\u00ean c\u1ee7a ng\u01b0\u1eddi con g\u00e1i.\"H\u00e0n Duy\u00ean\" mong mu\u1ed1n con luy\u00ean duy\u00ean d\u00e1ng xinh t\u01b0\u01a1i v\u00e0 k\u1ebft n\u1ed1i \u0111\u01b0\u1ee3c nh\u1eefng \u0111i\u1ec1u tinh t\u1ebf c\u1ee7a cu\u1ed9c s\u1ed1ng t\u1ea1o n\u00ean s\u1ef1 h\u00e0i h\u00f2a cho t\u01b0\u01a1ng lai c\u1ee7a con", "sex": 5}
{"first_name": "H\u1eb1ng Duy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t  \"H\u1eb1ng\" trong ch\u1eef H\u1eb1ng Nga \u00fd ch\u1ec9 m\u1ed9t ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, thanh tho\u00e1t, nh\u1eb9 nh\u00e0ng.\"Duy\u00ean\" ngh\u0129a l\u00e0 s\u1ef1 h\u00e0i ho\u00e0 c\u1ee7a m\u1ed9t s\u1ed1 n\u00e9t t\u1ebf nh\u1ecb \u0111\u00e1ng y\u00eau t\u1ea1o n\u00ean v\u1ebb h\u1ea5p d\u1eabn t\u1ef1 nhi\u00ean c\u1ee7a ng\u01b0\u1eddi con g\u00e1i.\"H\u1eb1ng Duy\u00ean\" mong mu\u1ed1n con lu\u00f4n xinh \u0111\u1eb9p thanh tho\u00e1t nh\u1eb9 nh\u00e0ng duy\u00ean d\u00e1ng trong m\u1eaft m\u1ecdi ng\u01b0\u1eddi.", "sex": 5}
