{"first_name": "Hoa Duy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Hoa\" l\u00e0 s\u1ef1 k\u1ebft tinh \u0111\u1eb9p \u0111\u1ebd c\u1ee7a tr\u1eddi \u0111\u1ea5t Hoa mang \u0111\u1ebfn s\u1ef1 sinh \u0111\u1ed9ng & t\u00f4 \u0111i\u1ec3m s\u1eafc m\u00e0u cho cu\u1ed9c s\u1ed1ng. M\u1ed7i lo\u00e0i hoa th\u01b0\u1eddng mang m\u1ed9t \u00fd ngh\u0129a kh\u00e1c nhau t\u01b0\u1ee3ng tr\u01b0ng cho nh\u1eefng t\u00ednh c\u00e1ch, ph\u1ea9m ch\u1ea5t kh\u00e1c nhau c\u1ee7a con ng\u01b0\u1eddi, nh\u01b0ng nh\u00ecn chung hoa l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng d\u00e0nh cho ph\u00e1i \u0111\u1eb9p. T\u00ean \"Hoa\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho n\u1eef, ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi con g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, thu h\u00fat. \"Duy\u00ean\" ngh\u0129a l\u00e0 s\u1ef1 h\u00e0i ho\u00e0 c\u1ee7a m\u1ed9t s\u1ed1 n\u00e9t t\u1ebf nh\u1ecb, \u0111\u00e1ng y\u00eau, t\u1ea1o n\u00ean v\u1ebb h\u1ea5p d\u1eabn t\u1ef1 nhi\u00ean c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \"Hoa Duy\u00ean\" mong mu\u1ed1n con xinh \u0111\u1eb9p, di\u0323u d\u00e0ng, nh\u1eb9 nh\u00e0ng nh\u01b0 nh\u1eefng c\u00e1nh hoa, t\u00f4 \u0111i\u1ec3m cho cu\u1ed9c s\u1ed1ng th\u00eam t\u01b0\u01a1i \u0111\u1eb9p.", "sex": 5}
