{"first_name": "H\u01b0\u01a1ng Duy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"H\u01b0\u01a1ng\" c\u00f3 hai \u00fd ngh\u0129a, v\u1eeba ch\u1ec9 l\u00e0 qu\u00ea nh\u00e0, l\u00e0 n\u01a1i ch\u1ed1n x\u01b0a, v\u1eeba ch\u1ec9 m\u00f9i h\u01b0\u01a1ng th\u01a1m. Khi d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean, t\u00ean \"H\u01b0\u01a1ng\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c ch\u1ecdn \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho con g\u00e1i v\u1edbi \u00fd ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m nhi\u1ec1u h\u01a1n, th\u1ec3 hi\u1ec7n \u0111\u01b0\u1ee3c s\u1ef1 d\u1ecbu d\u00e0ng, quy\u1ebfn r\u0169, thanh cao v\u00e0 \u0111\u1eb1m th\u1eafm c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \"Duy\u00ean\" ngh\u0129a l\u00e0 s\u1ef1 h\u00e0i ho\u00e0 c\u1ee7a m\u1ed9t s\u1ed1 n\u00e9t t\u1ebf nh\u1ecb, \u0111\u00e1ng y\u00eau, t\u1ea1o n\u00ean v\u1ebb h\u1ea5p d\u1eabn t\u1ef1 nhi\u00ean c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \"H\u01b0\u01a1ng Duy\u00ean\" mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, quy\u1ebfn r\u0169, s\u1eafc n\u01b0\u1edbc h\u01b0\u01a1ng tr\u1eddi v\u00e0 nh\u1eb9 nh\u00e0ng, \u0111\u1eb1m th\u1eafm.", "sex": 5}
{"first_name": "H\u1eefu Duy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"H\u1eefu\" c\u00f3 ngh\u0129a l\u00e0 s\u1edf h\u1eefu, l\u00e0 c\u00f3. \"Duy\u00ean\" ngh\u0129a l\u00e0 s\u1ef1 h\u00e0i ho\u00e0 c\u1ee7a m\u1ed9t s\u1ed1 n\u00e9t t\u1ebf nh\u1ecb, \u0111\u00e1ng y\u00eau, t\u1ea1o n\u00ean v\u1ebb h\u1ea5p d\u1eabn t\u1ef1 nhi\u00ean c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \"Th\u1ee5y Duy\u00ean\" mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p, gi\u1ecfi giang, v\u00e0 l\u00e0 ng\u01b0\u1eddi c\u00f3 nhi\u1ec1u \u0111\u1ee9c t\u00ednh t\u1ed1t \u0111\u1eb9p.", "sex": 5}
