{"first_name": "Kim Duy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Kim\" c\u00f3 ngh\u0129a l\u00e0 ti\u1ec1n, l\u00e0 v\u00e0ng. T\u00ean \"Kim\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c cha m\u1eb9 \u0111\u1eb7t v\u1edbi h\u00e0m \u00fd mong mu\u1ed1n cu\u1ed9c s\u1ed1ng sung t\u00fac, ph\u00fa qu\u00fd v\u1eefng b\u1ec1n d\u00e0nh cho con c\u00e1i. \"Duy\u00ean\" ngh\u0129a l\u00e0 s\u1ef1 h\u00e0i ho\u00e0 c\u1ee7a m\u1ed9t s\u1ed1 n\u00e9t t\u1ebf nh\u1ecb, \u0111\u00e1ng y\u00eau, t\u1ea1o n\u00ean v\u1ebb h\u1ea5p d\u1eabn t\u1ef1 nhi\u00ean c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \"Kim Duy\u00ean\" mong mu\u1ed1n con xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng v\u00e0 t\u01b0\u01a1ng lai c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac, \u0111\u1ea7y \u0111\u1ee7 b\u1ec1n v\u1eefng, l\u00e2u d\u00e0i.", "sex": 5}
