{"first_name": "T\u00fa Duy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"T\u00fa\" l\u00e0 ng\u00f4i sao, v\u00ec tinh t\u00fa l\u1ea5p l\u00e1nh chi\u1ebfu s\u00e1ng tr\u00ean cao. Ngo\u00e0i ra \"T\u00fa\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 dung m\u1ea1o xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau. \"Duy\u00ean\" ngh\u0129a l\u00e0 s\u1ef1 h\u00e0i ho\u00e0 c\u1ee7a m\u1ed9t s\u1ed1 n\u00e9t t\u1ebf nh\u1ecb, \u0111\u00e1ng y\u00eau, t\u1ea1o n\u00ean v\u1ebb h\u1ea5p d\u1eabn t\u1ef1 nhi\u00ean c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \"T\u00fa Duy\u00ean\" mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau nh\u01b0 nh\u1eefng v\u00ec sao l\u1ea5p l\u00e1nh.", "sex": 5}
