{"first_name": "V\u00e2n Duy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"V\u00e2n\" l\u00e0 m\u00e2y, g\u1ee3i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0 \u0111\u00e1m m\u00e2y tr\u1eafng b\u1ed3ng b\u1ec1nh tr\u00ean tr\u1eddi. \"Duy\u00ean\" ngh\u0129a l\u00e0 s\u1ef1 h\u00e0i ho\u00e0 c\u1ee7a m\u1ed9t s\u1ed1 n\u00e9t t\u1ebf nh\u1ecb, \u0111\u00e1ng y\u00eau, t\u1ea1o n\u00ean v\u1ebb h\u1ea5p d\u1eabn t\u1ef1 nhi\u00ean c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \"V\u00e2n Duy\u00ean\" mong mu\u1ed1n con xinh \u0111\u1eb9p d\u1ecbu d\u00e0ng v\u00e0 g\u1ee3i c\u1ea3m nh\u01b0 nh\u1eefng \u00e1ng m\u00e2y b\u1ed3ng b\u1ec1nh.", "sex": 5}
{"first_name": "Xu\u00e2n Duy\u00ean", "meaning": "Xu\u00e2n Duy\u00ean ch\u1ec9 v\u00e0o ng\u01b0\u1eddi con g\u00e1i c\u00f3 duy\u00ean ph\u1eadn t\u1ed1t \u0111\u1eb9p.", "sex": 5}
{"first_name": "\u00dd Duy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\u00dd\" l\u00e0 ng\u01b0\u1eddi c\u00f3 quy\u1ebft t\u00e2m d\u1ed3n s\u1ee9c l\u1ef1c, tr\u00ed tu\u1ec7 \u0111\u1ea1t cho b\u1eb1ng \u0111\u01b0\u1ee3c m\u1ee5c \u0111\u00edch, m\u1ed9t ng\u01b0\u1eddi m\u1ea1nh m\u1ebd, s\u1ed1ng c\u00f3 l\u00fd t\u01b0\u1edfng. \"Duy\u00ean\" ngh\u0129a l\u00e0 s\u1ef1 h\u00e0i ho\u00e0 c\u1ee7a m\u1ed9t s\u1ed1 n\u00e9t t\u1ebf nh\u1ecb, \u0111\u00e1ng y\u00eau, t\u1ea1o n\u00ean v\u1ebb h\u1ea5p d\u1eabn t\u1ef1 nhi\u00ean c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \"\u00dd Duy\u00ean\" con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p v\u00e0 t\u00e0i gi\u1ecfi, l\u00e0 ng\u01b0\u1eddi c\u00f3 \u00fd ch\u00ed m\u1ea1nh m\u1ebd, bi\u1ebft v\u01b0\u1ee3t qua m\u1ecdi th\u1eed th\u00e1ch \u0111\u1ec3 th\u00e0nh c\u00f4ng trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
{"first_name": "Anh Th\u1eafm", "meaning": "Ch\u1eef Anh theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 \u201cng\u01b0\u1eddi t\u00e0i gi\u1ecfi\u201d v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n, v\u00ec v\u1eady t\u00ean \"Anh Th\u1eafm\" th\u1ec3 hi\u1ec7n mong mu\u1ed1n t\u1ed1t \u0111\u1eb9p c\u1ee7a cha m\u1eb9 d\u00e0nh cho con m\u00ecnh c\u00f3 \u0111\u01b0\u1ee3c s\u1ef1 gi\u1ecfi giang, xinh \u0111\u1eb9p, l\u1ea1i nhu m\u00ec, n\u1ebft na", "sex": 5}
{"first_name": "H\u1ea1nh Th\u1eafm", "meaning": "Theo H\u00e1n - Vi\u1ec7t, t\u00ean \"H\u1ea1nh\" c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 ph\u00fac l\u1ed9c, l\u00e0 ph\u01b0\u1edbc l\u00e0nh, c\u00f3 \u0111\u1ee9c h\u1ea1nh. \"Th\u1eafm\" l\u00e0 m\u00e0u \u0111\u1ecf \u0111\u1eadm, d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i m\u00e1 h\u1ed3ng m\u00f4i th\u1eafm. T\u00ean \"H\u1ea1nh Th\u1eafm\" th\u01b0\u1eddng d\u00f9ng cho n\u1eef, ch\u1ec9 ng\u01b0\u1eddi n\u1ebft na, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, \u0111\u00f4n h\u1eadu, ph\u1ea9m ch\u1ea5t cao \u0111\u1eb9p", "sex": 5}
{"first_name": "H\u1ed3ng Th\u1eafm", "meaning": "\"Theo t\u1eeb \u0111i\u1ec3n Ti\u1ebfng Vi\u1ec7t, \"\"H\u1ed3ng Th\u1eafm\"\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 \u0111\u1ebfn m\u00e0u h\u1ed3ng \u0111\u1ecf, d\u00f9ng \u0111\u1ec3 g\u1ee3i \u0111\u1ebfn h\u00ecnh \u1ea3nh ng\u01b0\u1eddi con g\u00e1i m\u00e1 th\u1eafm m\u00f4i h\u1ed3ng, d\u1ecbu d\u00e0ng, \u0111\u1eb1m th\u1eafm. \"\"H\u1ed3ng Th\u1eafm\"\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean r\u1ea5t m\u1ed9c m\u1ea1c, gi\u1ea3n d\u1ecb, th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t b\u1edfi ng\u01b0\u1eddi \u01a1\u0309 v\u00f9ng \u0111\u1ed3ng b\u1eb1ng B\u1eafc b\u1ed9 n\u01b0\u01a1\u0301c ta.\r\nT\u00ean n\u00e0y c\u00f3 \u00fd ngh\u0129a mong con l\u1edbn l\u00ean s\u1ebd xinh \u0111\u1eb9p, da d\u1ebb h\u1ed3ng h\u00e0o, kho\u1ebb m\u1ea1nh.\"", "sex": 5}
{"first_name": "Minh Th\u1eafm", "meaning": "B\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, Minh c\u00f2n c\u00f3 ngh\u0129a ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (b\u00ecnh minh) th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p.  \"Th\u1eafm\" l\u00e0 m\u00e0u \u0111\u1ecf \u0111\u1eadm, d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i m\u00e1 h\u1ed3ng m\u00f4i th\u1eafm. T\u00ean Minh Th\u1eafm d\u00f9ng \u0111\u1ebf n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i v\u1eeba c\u00f3 t\u00e0i v\u1eeba c\u00f3 s\u1eafc, th\u00f9y m\u1ecb, \u0111oan trang, ngoan hi\u1ec1n, hi\u1ebfu k\u00ednh", "sex": 5}
{"first_name": "Thu Th\u1eafm", "meaning": "Theo ngh\u0129a Ti\u1ebfng Vi\u1ec7t, \"Thu\" l\u00e0 m\u00f9a thu, l\u00e0 m\u00f9a chuy\u1ec3n ti\u1ebfp t\u1eeb h\u1ea1 sang \u0111\u00f4ng, th\u1eddi ti\u1ebft d\u1ecbu m\u00e1t d\u1ea7n. Ngo\u00e0i ra, \"Thu\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 nh\u1eadn l\u1ea5y, nh\u1eadn v\u1ec1 t\u1eeb nhi\u1ec1u ngu\u1ed3n, nhi\u1ec1u n\u01a1i. T\u00ean \"Thu Th\u1eafm\" l\u00e0 mong cho con s\u1ebd trong s\u00e1ng, xinh \u0111\u1eb9p, th\u00f9y m\u1ecb, \u0111\u00e1ng y\u00eau nh\u01b0 kh\u00ed tr\u1eddi m\u00f9a thu, \u0111\u1ed3ng th\u1eddi con s\u1ebd lu\u00f4n nh\u1eadn \u0111\u01b0\u1ee3c nhi\u1ec1u s\u1ef1 y\u00eau th\u01b0\u01a1ng v\u00e0 may m\u1eafn", "sex": 5}
{"first_name": "\u0110\u00ecnh Th\u00e1m", "meaning": "\"\u0110\u00ecnh Th\u00e1m\" l\u00e0 d\u1ecd x\u00e9t n\u01a1i quy\u1ec1n qu\u00fd, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi c\u00f3 kh\u00ed ch\u1ea5t t\u00e0i n\u0103ng, s\u00e1ng t\u1ea1o v\u00e0 m\u01b0u l\u01b0\u1ee3c.", "sex": 3}
