{"first_name": "Anh Ly", "meaning": "\"Anh Ly l\u00e0 m\u1ed9t c\u00e1i t\u00ean r\u1ea5t hay v\u00e0 nh\u1eb9 nh\u00e0ng, kh\u00f4ng ch\u1ec9 v\u00ec 2 ti\u1ebfng c\u00f3 thanh ngang m\u00e0 c\u00f2n v\u00ec \u00fd ngh\u0129a c\u1ee7a 2 t\u1eeb Anh v\u00e0 Ly. \r\nTheo ti\u1ebfng H\u00e1n, Anh ngh\u0129a l\u00e0 s\u1ef1 th\u00f4ng minh t\u00e0i n\u0103ng h\u01a1n ng\u01b0\u1eddi; Ly l\u00e0 qu\u00e3ng xa. Anh Ly l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c g\u1eedi g\u1eafm \u00fd ngh\u0129a v\u1ec1 m\u1ed9t ng\u01b0\u1eddi th\u00f4ng minh t\u00e0i n\u0103ng h\u01a1n ng\u01b0\u1eddi, \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi bi\u1ebft \u0111\u1ebfn, kh\u00f4ng k\u1ec3 kho\u1ea3ng c\u00e1ch.\"", "sex": 5}
