{"first_name": "Uy Th\u00e0nh", "meaning": "Ch\u1eef  \"Th\u00e0nh\" theo ngh\u0129a  H\u00e1n-Vi\u1ec7t  th\u01b0\u1eddng ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 th\u1ec3 ch\u1ea5t kh\u1ecfe m\u1ea1nh, suy ngh\u0129 quy\u1ebft \u0111o\u00e1n, r\u1ea5t v\u1eefng ch\u1eafc trong suy ngh\u0129 v\u00e0 h\u00e0nh \u0111\u1ed9ng.  \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd.  V\u00ec v\u1eady, \"Th\u00e0nh Uy\" th\u01b0\u1eddng d\u00f9ng \u0111\u1eb7t t\u00ean cho ng\u01b0\u1eddi con trai v\u1edbi t\u00ednh c\u00e1ch m\u1ea1nh, hi\u00ean ngang", "sex": 3}
