{"first_name": "Minh L\u00fd", "meaning": "L\u00fd l\u00e0 hoa thi\u00ean l\u00fd, \u0111\u1eb9p m\u1ed9c m\u1ea1c ch\u00e2n ph\u01b0\u01a1ng hay c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u1ebd ph\u1ea3i. Minh l\u00e0 th\u00f4ng minh, s\u00e1ng d\u1ea1, nh\u01b0 \u00e1nh b\u00ecnh minh chi\u1ebfu r\u1ea1ng mang l\u1ea1i 1 ng\u00e0y m\u1edbi t\u1ed1t \u0111\u1eb9p. Minh L\u00fd c\u00f3 ngh\u0129a con th\u00f4ng minh, t\u00e0i tr\u00ed, s\u00e1ng d\u1ea1 nh\u01b0 \u00e1nh b\u00ecnh minh ng\u00e0y m\u1edbi v\u00e0 bi\u1ebft l\u00fd l\u1ebd, s\u1ed1ng theo l\u1ebd ph\u1ea3i, c\u00f4ng b\u1eb1ng.", "sex": 7}
{"first_name": "M\u1ef9 L\u00fd", "meaning": "\"M\u1ef9\" l\u00e0 \u0111\u1eb9p \u0111\u1ebd. \"M\u1ef9 L\u00fd\" l\u00e0 b\u00f4ng l\u00fd xinh \u0111\u1eb9p, h\u00e0m ngh\u0129a ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p d\u1ecbu d\u00e0ng k\u00edn \u0111\u00e1o.", "sex": 5}
{"first_name": "Ng\u1ecdc L\u00fd", "meaning": "L\u00fd l\u00e0 hoa thi\u00ean l\u00fd, \u0111\u1eb9p m\u1ed9c m\u1ea1c ch\u00e2n ph\u01b0\u01a1ng hay c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u1ebd ph\u1ea3i. Ng\u1ecdc l\u00e0 ng\u1ecdc ng\u00e0 ch\u00e2u b\u00e1u qu\u00fd gi\u00e1. Ng\u1ecdc L\u00fd c\u00f3 ngh\u0129a con xinh \u0111\u1eb9p, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, ch\u00e2n th\u1eadt, qu\u00fd gi\u00e1, thanh cao nh\u01b0 hoa thi\u00ean l\u00fd b\u1eb1ng ng\u1ecdc", "sex": 7}
{"first_name": "Nh\u00e3 L\u00fd", "meaning": "L\u00fd l\u00e0 hoa thi\u00ean l\u00fd, \u0111\u1eb9p m\u1ed9c m\u1ea1c ch\u00e2n ph\u01b0\u01a1ng hay c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u1ebd ph\u1ea3i. Nh\u00e3 l\u00e0 nho nh\u00e3, nh\u1eb9 nh\u00e0ng, th\u00e1i \u0111\u1ed9 t\u1eeb t\u1ed1n. Nh\u00e3 L\u00fd l\u00e0 b\u00f4ng hoa thi\u00ean l\u00fd xinh \u0111\u1eb9p, m\u1ed9c m\u1ea1c b\u00ecnh d\u1ecb, c\u00f3 phong th\u00e1i nh\u1eb9 nh\u00e0ng, thanh tao, nho nh\u00e3, t\u1eeb t\u1ed1n", "sex": 7}
{"first_name": "Ph\u01b0\u01a1ng L\u00fd", "meaning": "\"Ph\u01b0\u01a1ng\" l\u00e0 c\u1ecf th\u01a1m. \"Ph\u01b0\u01a1ng L\u00fd\" l\u00e0 hoa l\u00fd th\u01a1m ng\u00e1t, th\u1ec3 hi\u1ec7n c\u00e1i \u0111\u1eb9p nh\u1eb9 nh\u00e0ng s\u00e2u s\u1eafc.", "sex": 5}
{"first_name": "Quang L\u00fd", "meaning": "L\u00fd l\u00e0 hoa thi\u00ean l\u00fd, \u0111\u1eb9p m\u1ed9c m\u1ea1c ch\u00e2n ph\u01b0\u01a1ng hay c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u1ebd ph\u1ea3i. Quang l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 vinh hi\u1ec3n, gi\u00e0u c\u00f3. Quang L\u00fd c\u00f3 ngh\u0129a cha m\u1eb9 mong con th\u00f4ng minh, s\u00e1ng su\u1ed1t, t\u00e0i n\u0103ng, t\u01b0\u01a1i lai ng\u00e0y c\u00e0ng t\u1ed1t \u0111\u1eb9p, nh\u01b0 \u0111\u01b0\u1ee3c soi s\u00e1ng", "sex": 7}
{"first_name": "S\u01a1n L\u00fd", "meaning": "L\u00fd l\u00e0 hoa thi\u00ean l\u00fd, \u0111\u1eb9p m\u1ed9c m\u1ea1c ch\u00e2n ph\u01b0\u01a1ng hay c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u1ebd ph\u1ea3i. S\u01a1n l\u00e0 n\u00fai. S\u01a1n L\u00fd l\u00e0 hoa thi\u00ean l\u00fd c\u1ee7a mi\u1ec1n n\u00fai, xinh \u0111\u1eb9p, m\u1ed9c m\u1ea1c nh\u01b0ng m\u1ea1nh m\u1ebd, thu h\u00fat", "sex": 7}
{"first_name": "Thanh L\u00fd", "meaning": "Thanh theo ti\u1ebfng H\u00e1n - Vi\u1ec7t l\u00e0 trong s\u1ea1ch, li\u00eam khi\u1ebft. V\u00e0 L\u00fd l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa hay c\u00f2n mang \u00fd ngh\u0129a ng\u01b0\u1eddi s\u1ed1ng ngay th\u1eb3ng, theo l\u1ebd ph\u1ea3i. Thanh L\u00fd mang \u00fd ngh\u0129a con l\u00e0 b\u00f4ng hoa xinh \u0111\u1eb9p, m\u1ed9c m\u1ea1c g\u1ea7n g\u0169i & t\u00e2m h\u1ed3n li\u00eam khi\u1ebft, thanh cao", "sex": 5}
{"first_name": "Th\u1ea3o L\u00fd", "meaning": "\"Ly\" l\u00e0 m\u1ed9t trong t\u1ee9 Linh bi\u1ec3u t\u01b0\u1ee3ng cho tr\u00ed tu\u1ec7, \"Th\u1ea3o\" l\u00e0 c\u1ecf, d\u1ecbu d\u00e0ng, mong manh, b\u00ecnh d\u1ecb nh\u01b0ng c\u0169ng r\u1ea5t m\u1ea1nh m\u1ebd, c\u00f3 kh\u1ea3 n\u0103ng sinh t\u1ed3n cao.\r\nNgo\u00e0i ra, \"th\u1ea3o\" c\u00f2n c\u00f3 \u00fd ngh\u0129a l\u00e0 s\u1ef1 hi\u1ec1n th\u1ee5c, t\u1ed1t b\u1ee5ng, ngoan hi\u1ec1n trong t\u1ea5m l\u00f2ng th\u01a1m th\u1ea3o, s\u1ef1 hi\u1ebfu th\u1ea3o. T\u00ean \"Th\u1ea3o Ly \" v\u1edbi \u00fd mu\u1ed1n mong con m\u00ecnh s\u1ebd th\u00f4ng minh, t\u1ecfa h\u01b0\u01a1ng cho \u0111\u1eddi.", "sex": 5}
{"first_name": "Thi\u00ean L\u00fd", "meaning": "Thi\u00ean L\u00fd l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa d\u00e2y leo m\u1ed9c m\u1ea1c, Thi\u00ean L\u00fd c\u00f2n c\u00f3 \u00fd ngh\u0129a l\u00e0 \"ngh\u00ecn d\u1eb7m\". V\u1edbi t\u00ean Thi\u00ean L\u00fd cha m\u1eb9 mong con s\u1ed1ng ch\u00e2n th\u00e0nh, \u0111\u01a1n gi\u1ea3n nh\u01b0ng t\u1ed1t t\u00ednh, ti\u1ebfng th\u01a1m vang xa ng\u00e0n d\u1eb7m", "sex": 5}
{"first_name": "Th\u01b0\u01a1ng L\u00fd", "meaning": "\"Th\u01b0\u01a1ng\" l\u00e0 th\u1eddi \u0111\u1ea1i c\u1ed5 Trung Qu\u1ed1c. \"Th\u01b0\u01a1ng L\u00fd\" l\u00e0 b\u00f4ng hoa l\u00fd nh\u00e0 Th\u01b0\u01a1ng, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi s\u00e2u s\u1eafc tuy\u1ec7t m\u1ef9.", "sex": 5}
