{"first_name": "C\u1ea9m Th\u00e1i", "meaning": "\"Th\u00e1i\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng th\u00e1i, thu\u1eadn l\u1ee3i, ch\u1ec9 s\u1ef1 y\u00ean vui, b\u00ecnh y\u00ean, th\u01b0 th\u00e1i.  \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0  v\u1ebb \u0111\u1eb9p \u0111a m\u00e0u s\u1eafc v\u00e0 tinh t\u1ebf. \u0110\u1eb7t con t\u00ean \"Th\u00e1i C\u1ea9m\" l\u00e0 mong con c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean vui v\u1ebb, t\u00e2m h\u1ed3n l\u1ea1c quan, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean.", "sex": 5}
{"first_name": "Chi Th\u00e1i", "meaning": "\"Th\u00e1i\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng th\u00e1i, thu\u1eadn l\u1ee3i, th\u1ec3 hi\u1ec7n s\u1ef1 y\u00ean vui. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh, trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i.  \"Th\u00e1i Chi\" - s\u1ef1 k\u1ebft h\u1ee3p c\u00f3 ngh\u0129a l\u00e0 b\u1ed1 m\u1eb9 mong con \u0111\u01b0\u1ee3c b\u00ecnh y\u00ean (th\u00e1i), kh\u00f4ng v\u1ea5p ph\u1ea3i nh\u1eefng s\u00f3ng gi\u00f3, b\u1ea5t tr\u1eafc tr\u00ean b\u01b0\u1edbc \u0111\u01b0\u1eddng \u0111\u1eddi.", "sex": 5}
