{"first_name": "D\u01b0\u01a1ng Th\u00e1i", "meaning": "D\u01b0\u01a1ng trong Th\u00e1i D\u01b0\u01a1ng hay c\u00f2n g\u1ecdi l\u00e0 m\u1eb7t tr\u1eddi \u00fd ch\u1ec9 lu\u00f4n r\u1ea1ng ng\u1eddi, chi\u1ebfu s\u00e1ng. T\u00ean \"D\u01b0\u01a1ng Th\u00e1i\" th\u1ec3 hi\u1ec7n s\u1ef1 th\u00f4ng minh, t\u00e0i gi\u1ecfi, lu\u00f4n g\u1eb7p may m\u1eafn, thu\u1eadn l\u1ee3i trong cu\u1ed9c s\u1ed1ng. B\u1ed1 m\u1eb9 hy vong con mang l\u1ea1i v\u1ebb vang cho d\u00f2ng t\u1ed9c", "sex": 3}
