{"first_name": "Khoa Th\u00e1i", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Th\u00e1i\" c\u00f3 ngh\u0129a l\u00e0 th\u00e1i b\u00ecnh th\u1ecbnh v\u01b0\u1ee3ng, s\u1ef1 y\u00eau \u1ed5n ph\u1ed3ng vinh. \"Khoa\" th\u01b0\u1eddng mang h\u00e0m \u00fd t\u1ed1t \u0111\u1eb9p, ch\u1ec9 s\u1ef1 vi\u1ec7c to l\u1edbn, d\u00f9ng \u0111\u1ec3 n\u00f3i v\u1ec1 ng\u01b0\u1eddi c\u00f3 \u0111\u1ecba v\u1ecb x\u00e3 h\u1ed9i & tr\u00ecnh \u0111\u1ed9 h\u1ecdc v\u1ea5n. Theo v\u0103n h\u00f3a c\u1ee7a ng\u01b0\u1eddi x\u01b0a, c\u00e1c \u0111\u1ea5ng nam nhi th\u01b0\u1eddng l\u1ea5y c\u00f4ng danh \u0111\u1ed7 \u0111\u1ea1t l\u00e0m tr\u1ecdng n\u00ean t\u00ean \"Khoa\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 mong mu\u1ed1n con c\u00e1i sau n\u00e0y t\u00e0i n\u0103ng, th\u00f4ng minh, ham h\u1ecdc h\u1ecfi, s\u1edbm \u0111\u1ed7 \u0111\u1ea1t th\u00e0nh danh.\"Th\u00e1i Khoa\"mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi gi\u1ecfi giang th\u00f4ng minh t\u00e0i tr\u00ed c\u00f3 h\u1ecdc th\u1ee9c cao v\u00e0 \u0111\u1ea1t \u0111\u01b0\u1ee3c nhi\u1ec1u th\u00e0nh c\u00f4ng trong cu\u1ed9c s\u1ed1ng.", "sex": 3}
{"first_name": "Kh\u00f4i Th\u00e1i", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Th\u00e1i\" c\u00f3 ngh\u0129a l\u00e0 th\u00e1i b\u00ecnh th\u1ecbnh v\u01b0\u1ee3ng, s\u1ef1 y\u00eau \u1ed5n ph\u1ed3n vinh.\"Kh\u00f4i\" c\u0169ng nh\u01b0 t\u00ean \"Khoa\" th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi t\u00e0i n\u0103ng b\u1eadc nh\u1ea5t, l\u00e0 ng\u01b0\u1eddi gi\u1ecfi \u0111\u1ee9ng \u0111\u1ea7u trong s\u1ed1 nh\u1eefng ng\u01b0\u1eddi gi\u1ecfi. \"Kh\u00f4i\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 m\u1ed9t th\u1ee9 \u0111\u00e1 \u0111\u1eb9p, qu\u00fd gi\u00e1. Ngh\u0129a c\u1ee7a \"Kh\u00f4i\" trong t\u00ean g\u1ecdi th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi xinh \u0111\u1eb9p, v\u1ebb ngo\u00e0i tu\u1ea5n t\u00fa, oai v\u1ec7, ph\u1ea9m ch\u1ea5t th\u00f4ng minh, s\u00e1ng d\u1ea1, l\u00e0 ng\u01b0\u1eddi c\u00f3 t\u00e0i & thi c\u1eed \u0111\u1ed7 \u0111\u1ea1t, th\u00e0nh danh.\"Th\u00e1i Kh\u00f4i\" mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi kh\u00f4i ng\u00f4 tu\u1ea5n t\u00fa t\u00e0i gi\u1ecfi, th\u00e0nh c\u00f4ng trong cu\u1ed9c s\u1ed1ng.", "sex": 3}
{"first_name": "Kh\u01b0\u01a1ng Th\u00e1i", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Th\u00e1i\" c\u00f3 ngh\u0129a l\u00e0 th\u00e1i b\u00ecnh th\u1ecbnh v\u01b0\u1ee3ng, s\u1ef1 y\u00eau \u1ed5n ph\u1ed3ng vinh. \"Kh\u01b0\u01a1ng\" c\u0169ng mang \u00fd ngh\u0129a nh\u01b0 ch\u1ec9 s\u1ef1 y\u00ean \u1ed5n, an b\u00ecnh ho\u1eb7c \u0111\u01b0\u1ee3c d\u00f9ng khi n\u00f3i \u0111\u1ebfn s\u1ef1 gi\u00e0u c\u00f3, \u0111\u1ee7 \u0111\u1ea7y.\"Kh\u01b0\u01a1ng Th\u00e1i\" t\u00ean con th\u1ec3 hi\u1ec7n \u00fd ngh\u0129a mong mu\u1ed1n cu\u1ed9c s\u1ed1ng b\u00ecnh an, h\u1ea1nh ph\u00fac, lu\u00f4n lu\u00f4n c\u00f3 \u0111\u01b0\u1ee3c s\u1ef1 thanh th\u1ea3n, an nhi\u00ean", "sex": 3}
{"first_name": "M\u1ea1nh Th\u00e1i", "meaning": "\"M\u1ea1nh\" l\u00e0 m\u1ea1nh t\u1eed ch\u1ec9 ng\u01b0\u1eddi c\u00f3 h\u1ecdc, v\u00f3c d\u00e1ng kh\u1ecfe m\u1ea1nh, t\u00ednh m\u1ea1nh m\u1ebd. T\u00ean \"M\u1ea1nh Th\u00e1i\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 v\u00f3c d\u00e1ng m\u1ea1nh kh\u1ecfe, c\u00f3 h\u1ecdc th\u1ee9c, cu\u1ed9c s\u1ed1ng an vui, h\u1ed3n nhi\u00ean, g\u1eb7p nhi\u1ec1u may m\u1eafn trong cu\u1ed9c s\u1ed1ng", "sex": 3}
{"first_name": "Minh Th\u00e1i", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, Minh c\u00f2n c\u00f3 ngh\u0129a ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (b\u00ecnh minh) th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. T\u00ean \"Minh Th\u00e1i\" th\u1ec3 hi\u1ec7n \u01b0\u1edbc mu\u1ed1n v\u1ec1 m\u1ed9t cu\u1ed9c \u0111\u1eddi t\u01b0\u01a1i s\u00e1ng c\u1ee7a m\u1ed9t ng\u01b0\u1eddi th\u00f4ng minh, hi\u1ec3u bi\u1ebft, g\u1eb7p nhi\u1ec1u may m\u1eafn, thu\u1eadn l\u1ee3i, ni\u1ec1m vui trong cu\u1ed9c s\u1ed1ng", "sex": 3}
{"first_name": "Ng\u1ecd Th\u00e1i", "meaning": "Th\u00e1i l\u00e0 qu\u00e1 h\u01a1n. Th\u00e1i Ng\u1ecd l\u00e0 v\u01b0\u1ee3t qua gi\u1edd ng\u1ecd, ng\u1ee5 \u00fd con ng\u01b0\u1eddi c\u00f3 b\u1ea3n l\u0129nh cao c\u01b0\u1eddng, kh\u00ed ch\u1ea5t m\u1ea1nh m\u1ebd", "sex": 3}
{"first_name": "Ng\u1ecdc Th\u00e1i", "meaning": "\"Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh,... th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed. T\u00ean Ng\u1ecdc Th\u00e1i th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o thanh cao, sang tr\u1ecdng, s\u1ed1ng trong gi\u00e0u sang, vinh hoa, ph\u00fa qu\u00fd", "sex": 3}
{"first_name": "Phi\u00ean Th\u00e1i", "meaning": "Th\u00e1i l\u00e0 qu\u00e1 l\u00ean. Th\u00e1i Phi\u00ean ngh\u0129a l\u00e0 nh\u1eb9 nh\u00e0ng bay l\u00ean, th\u1ec3 hi\u1ec7n d\u00e1ng \u0111i\u1ec7u t\u01b0\u01a1i t\u1eafn \u0111\u1eb9p \u0111\u1ebd, c\u1ed1t c\u00e1ch phi ph\u00e0m", "sex": 3}
