{"first_name": "Thanh Th\u00e1i", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 m\u00e0u xanh, tu\u1ed5i tr\u1ebb, c\u00f2n l\u00e0 s\u1ef1 thanh cao, trong s\u1ea1ch, thanh b\u1ea1ch. Ng\u01b0\u1eddi t\u00ean \"Thanh Th\u00e1i\" th\u01b0\u1eddng c\u00f3 kh\u00ed ch\u1ea5t \u0111i\u1ec1m \u0111\u1ea1m, nh\u1eb9 nh\u00e0ng v\u00e0 cao qu\u00fd, cu\u1ed9c s\u1ed1ng an vui, thanh nh\u00e0n", "sex": 3}
{"first_name": "Th\u00e0nh Th\u00e1i", "meaning": "Ch\u1eef  \"Th\u00e0nh\" theo ngh\u0129a  H\u00e1n-Vi\u1ec7t d\u00f9ng \u0111\u1ec3 ch\u1ec9 t\u01b0\u1eddng l\u1edbn bao quanh kinh \u0111\u00f4 ho\u1eb7c m\u1ed9t khu v\u1ef1c \u0111\u1ec3 ph\u00f2ng v\u1ec7 . T\u00ean  \"Th\u00e0nh Th\u00e1i\" th\u01b0\u1eddng ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 th\u1ec3 ch\u1ea5t kh\u1ecfe m\u1ea1nh, suy ngh\u0129 quy\u1ebft \u0111o\u00e1n, r\u1ea5t v\u1eefng ch\u1eafc trong suy ngh\u0129 v\u00e0 h\u00e0nh \u0111\u1ed9ng. T\u00ean \"Th\u00e0nh Th\u00e1i\" c\u00f2n c\u00f3  \u00fd ngh\u0129a l\u00e0 ho\u00e0n th\u00e0nh, tr\u1ecdn v\u1eb9n, lu\u00f4n l\u00e0m m\u1ecdi vi\u1ec7c \u0111\u01b0\u1ee3c ho\u00e0n h\u1ea3o, su\u00f4n s\u1ebb", "sex": 3}
{"first_name": "Th\u00f4ng Th\u00e1i", "meaning": "Theo ngh\u0129a ti\u1ebfng vi\u1ec7t, \"Th\u00f4ng th\u00e1i\" l\u00e0 m\u1ed9t t\u00ednh t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi h\u1ecdc r\u1ed9ng v\u00e0 hi\u1ec3u bi\u1ebft nhi\u1ec1u. \u0110\u1eb7t con t\u00ean \"Th\u00f4ng Th\u00e1i\" cha m\u1eb9 mong con s\u1ebd l\u00e0 ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7, h\u1ecdc r\u1ed9ng bi\u1ebft nhi\u1ec1u v\u00e0 c\u00f3 t\u01b0\u01a1ng lai t\u01b0\u01a1i s\u00e1ng", "sex": 3}
{"first_name": "U\u1ea9n Th\u00e1i", "meaning": "\"Th\u00e1i\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 hanh th\u00f4ng, thu\u1eadn l\u1ee3i, ch\u1ec9 s\u1ef1 y\u00ean vui, b\u00ecnh y\u00ean, th\u01b0 th\u00e1i. U\u1ea9n c\u00f3 ngh\u0129a l\u00e0 ti\u1ec1m \u1ea9n s\u1ee9c m\u1ea1nh. \u0110\u1eb7t con t\u00ean \"Th\u00e1i U\u1ea9n \" l\u00e0 mong con c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean vui v\u1ebb, t\u00e2m h\u1ed3n l\u1ea1c quan, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean v\u00e0 c\u01a1 nghi\u1ec7p s\u00e1ng ng\u1eddi", "sex": 3}
{"first_name": "\u01afng Th\u00e1i", "meaning": "\"Th\u00e1i\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 hanh th\u00f4ng, thu\u1eadn l\u1ee3i, ch\u1ec9 s\u1ef1 y\u00ean vui, b\u00ecnh y\u00ean, th\u01b0 th\u00e1i.  \"\u01afng\"  l\u00e0 chim \u01b0ng (\u0111\u1ea1i b\u00e0ng) t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 t\u00f4n qu\u00fd, ng\u1ee5 \u00fd nh\u00ecn xa, tr\u00f4ng r\u1ed9ng. \u0110\u1eb7t con t\u00ean \"Th\u00e1i \u01afng \" l\u00e0 mong con c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean vui v\u1ebb, t\u00e2m h\u1ed3n l\u1ea1c quan, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean", "sex": 3}
{"first_name": "Uy Th\u00e1i", "meaning": "Th\u00e1i theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 hanh th\u00f4ng, thu\u1eadn l\u1ee3i, ch\u1ec9 s\u1ef1 y\u00ean vui, b\u00ecnh y\u00ean, th\u01b0 th\u00e1i. \u0110\u1eb7t con t\u00ean \"Th\u00e1i\" l\u00e0 mong con c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean vui v\u1ebb, t\u00e2m h\u1ed3n l\u1ea1c quan, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean. \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd.  V\u00ec v\u1eady, \"Th\u00e1i Uy\" l\u00e0 t\u00ean hay  th\u01b0\u1eddng d\u00f9ng \u0111\u1eb7t cho ng\u01b0\u1eddi con trai v\u1edbi t\u00ednh c\u00e1ch m\u1ea1nh m\u1ebd, hi\u00ean ngang", "sex": 3}
{"first_name": "Uy\u00ean Th\u00e1i", "meaning": "Th\u00e1i theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 hanh th\u00f4ng, thu\u1eadn l\u1ee3i, ch\u1ec9 s\u1ef1 y\u00ean vui, b\u00ecnh y\u00ean, th\u01b0 th\u00e1i. B\u00ean c\u1ea1nh \u0111\u00f3, \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \u0110\u1eb7t con t\u00ean \"Th\u00e1i Uy\u00ean\" l\u00e0 mong con c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean vui v\u1ebb, t\u00e2m h\u1ed3n l\u1ea1c quan, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean", "sex": 5}
