{"first_name": "Vinh Th\u00e1i", "meaning": "T\u00ean Vinh mang ngh\u0129a t\u01b0\u01a1i t\u1ed1t, ph\u1ed3n th\u1ecbnh, \u0111\u00f4ng \u0111\u00fac. T\u00ean \"Vinh Th\u00e1i\" d\u00f9ng \u0111\u1ec3 \u01b0\u1edbc mong cho t\u01b0\u01a1ng lai con c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng gi\u00e0u sang, hi\u1ec3n \u0111\u1ea1t, mang l\u1ea1i v\u1ebb vang cho d\u00f2ng t\u1ed9c", "sex": 3}
