{"first_name": "An Thanh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t,  \"An\" c\u00f3 ngh\u0129a l\u00e0 an l\u00e0nh hay b\u00ecnh an, \u00fd mu\u1ed1n n\u00f3i m\u1ed9t cu\u1ed9c s\u1ed1ng y\u00ean \u1ed5n, h\u1ea1nh ph\u00fac, kh\u00f4ng c\u00f3 s\u00f3ng gi\u00f3, \"Thanh\" l\u00e0 m\u00e0u xanh, tu\u1ed5i tr\u1ebb, trong s\u00e1ng. T\u00ean \"An Thanh\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi \u00fd ngh\u0129a mong con c\u00f3 t\u00e2m h\u1ed3n trong s\u00e1ng, thanh khi\u1ebft v\u00e0 lu\u00f4n g\u1eb7p may m\u1eafn, an l\u00e0nh.", "sex": 5}
