{"first_name": "Ba Thanh", "meaning": "Thanh l\u00e0 trong xanh, tinh khi\u1ebft. Thanh Ba l\u00e0 c\u01a1n s\u00f3ng l\u1edbn m\u1ea1nh m\u1ebd nh\u01b0ng trong l\u00e0nh, h\u00e0m ngh\u0129a ng\u01b0\u1eddi c\u00f3 h\u00e0nh vi c\u01b0\u01a1ng li\u1ec7t, m\u1ea1nh m\u1ebd nh\u01b0ng t\u1ed1 ch\u1ea5t l\u1ea1i t\u1ed1t l\u00e0nh v\u00e0 qu\u1ea3ng \u0111\u1ea1i.", "sex": 3}
