{"first_name": "B\u00e0ng Thanh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 m\u00e0u xanh, tu\u1ed5i tr\u1ebb, c\u00f2n l\u00e0 s\u1ef1 thanh cao, trong s\u1ea1ch, thanh b\u1ea1ch.  \"B\u00e0ng\" c\u00f3 ngh\u0129a l\u1edbn lao, d\u00e0y d\u1eb7n hay c\u00f2n c\u00f3 ngh\u0129a th\u1ecbnh v\u01b0\u1ee3ng. Ng\u01b0\u1eddi t\u00ean \"Thanh\" th\u01b0\u1eddng c\u00f3 kh\u00ed ch\u1ea5t \u0111i\u1ec1m \u0111\u1ea1m, nh\u1eb9 nh\u00e0ng v\u00e0 cao qu\u00fd.", "sex": 3}
{"first_name": "B\u0103ng Thanh", "meaning": "B\u0103ng theo ngh\u0129a H\u00e1n Vi\u1ec7t  v\u1eeba h\u00e0m \u00fd ch\u1ec9 c\u00e1i l\u1ea1nh b\u0103ng gia\u0301 v\u1eeba di\u1ec5n t\u1ea3 h\u00ecnh \u1ea3nh b\u0103ng tuy\u1ebft tr\u1eafng mu\u1ed1t, ng\u1ecdc ng\u00e0. Thanh t\u01b0\u0301c m\u00e0u xanh, s\u1ef1 trong s\u00e1ng, thanh khi\u1ebft.  V\u00ec v\u1eady, t\u00ean \"B\u0103ng Thanh\" th\u01b0\u1eddng  d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean v\u1edbi \u00fd ngh\u0129a mong cho t\u00e2m h\u1ed3n con s\u1ebd lu\u00f4n trong s\u00e1ng, \u0111\u1eb9p nh\u01b0 kh\u00f4\u0301i b\u0103ng thanh khi\u00ea\u0301t v\u00e0 \u00edt g\u1eb7p ph\u1ea3i gi\u00f4ng t\u1ed1 trong cu\u1ed9c \u0111\u1eddi.", "sex": 5}
