{"first_name": "Ki\u1ec1u Chinh", "meaning": "Theo ti\u1ebfng H\u00e1n, t\u00ean \"Ki\u1ec1u\" mang \u00fd ngh\u0129a l\u00e0 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, c\u00f3 nhan s\u1eafc rung \u0111\u1ed9ng l\u00f2ng ng\u01b0\u1eddi n\u00ean th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con g\u00e1i v\u1edbi mong mu\u1ed1n c\u00e1c b\u00e9 g\u00e1i khi l\u1edbn l\u00ean s\u1ebd c\u00f3 \u0111\u01b0\u1ee3c dung m\u1ea1o xinh x\u1eafn, duy\u00ean d\u00e1ng v\u00e0 t\u1ea1o \u1ea5n t\u01b0\u1ee3ng v\u1edbi m\u1ecdi ng\u01b0\u1eddi. Kh\u00f4ng ch\u1ec9 xinh \u0111\u1eb9p, khi k\u1ebft h\u1ee3p v\u1edbi t\u00ean Chinh, b\u1ed1 m\u1eb9 hi v\u1ecdng con m\u00ecnh s\u1ebd c\u00f3 \u01b0\u1edbc m\u01a1 ho\u00e0i b\u00e3o l\u1edbn lao, l\u00e0m n\u00ean c\u01a1 nghi\u1ec7p, t\u00e0i s\u1eafc v\u1eb9n to\u00e0n.", "sex": 5}
