{"first_name": "D\u00e3 Th\u1ea3o", "meaning": "\"Theo t\u1eeb \u0111i\u1ec3n c\u00e1c lo\u00e0i hoa, \"\"D\u00e3 Th\u1ea3o\"\" hay c\u00f2n g\u1ecdi l\u00e0 D\u00e3 y\u00ean th\u1ea3o l\u00e0 m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p, d\u1ec5 tr\u1ed3ng, nhi\u1ec1u m\u00e0u s\u1eafc.\r\nC\u00e1i t\u00ean \"\"D\u00e3 Th\u1ea3o\"\" g\u1ee3i l\u00ean s\u1ef1 xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau, nh\u1eb9 nh\u00e0ng v\u00e0 d\u1ec5 th\u00edch nghi v\u1edbi ho\u00e0n c\u1ea3nh s\u1ed1ng.\r\nCha m\u1eb9 mong con s\u1ebd duy\u00ean d\u00e1ng, d\u1ecbu d\u00e0ng v\u00e0 lu\u00f4n y\u00eau \u0111\u1eddi, tr\u00e0n \u0111\u1ea7y nh\u1ef1a s\u1ed1ng.\"", "sex": 5}
