{"first_name": "D\u00e2ng Th\u1ea3o", "meaning": "\"D\u00e2ng\" l\u00e0 v\u1ebb \u0111\u1eb9p trong s\u00e1ng th\u00e1nh thi\u1ec7n, \"Th\u1ea3o\" th\u01b0\u1eddng ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 v\u1ebb ngo\u00e0i d\u1ecbu d\u00e0ng, mong manh, b\u00ecnh d\u1ecb nh\u01b0ng c\u0169ng r\u1ea5t m\u1ea1nh m\u1ebd, c\u00f3 kh\u1ea3 n\u0103ng sinh t\u1ed3n cao. \"D\u00e2ng Th\u1ea3o\" mang \u00fd ngh\u0129a cha m\u1eb9 r\u1ea5t vui m\u1eebng v\u00ec con hi\u1ebfu th\u1ea3o, trong s\u00e1ng v\u00e0 bi\u1ebft v\u00e2ng l\u1eddi", "sex": 5}
