{"first_name": "\u0110i\u1ec7p Th\u1ea3o", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Th\u1ea3o\" th\u01b0\u1eddng ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 v\u1ebb ngo\u00e0i d\u1ecbu d\u00e0ng, mong manh, b\u00ecnh d\u1ecb nh\u01b0ng c\u0169ng r\u1ea5t m\u1ea1nh m\u1ebd, c\u00f3 kh\u1ea3 n\u0103ng sinh t\u1ed3n cao.\"\u0110i\u1ec7p\" c\u00f3 ngh\u0129a l\u00e0 b\u01b0\u01a1m b\u01b0\u1edbm. D\u1ef1a tr\u00ean h\u00ecnh \u1ea3nh c\u1ee7a b\u01b0\u1edbm th\u00ec t\u00ean \"\u0110i\u1ec7p Th\u1ea3o\" ch\u1ec9  ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau, l\u1ea1i c\u00f3 n\u00e9t vui t\u01b0\u01a1i, thanh tho\u00e1t, th\u1ec3 hi\u1ec7n mong mu\u1ed1n con sau n\u00e0y s\u1ebd c\u00f3 n\u00e9t \u0111\u1eb9p d\u1ecbu d\u1ea1ng xinh t\u01b0\u01a1i, b\u00ecnh d\u1ecb nh\u01b0ng c\u0169ng c\u00f3 \u00fd ch\u00ed m\u1ea1nh m\u1ebd tr\u01b0\u1edbc nh\u1eefng s\u00f3ng gi\u00f3 c\u1ee7a cu\u1ed9c \u0111\u1eddi.", "sex": 5}
