{"first_name": "H\u1ea1nh Th\u1ea3o", "meaning": "Theo H\u00e1n - Vi\u1ec7t, \"H\u1ea1nh\" th\u1ee9 nh\u1ea5t, c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 ph\u00fac l\u1ed9c, l\u00e0 ph\u01b0\u1edbc l\u00e0nh. Ngh\u0129a th\u1ee9 hai l\u00e0 n\u00f3i v\u1ec1 m\u1eb7t \u0111\u1ea1o \u0111\u1ee9c, t\u00ednh n\u1ebft c\u1ee7a con ng\u01b0\u1eddi. T\u00ean \"H\u1ea1nh Th\u1ea3o\" ch\u1ec9 ng\u01b0\u1eddi xinh \u0111\u1eb9p, m\u1ed9c m\u1ea1c, n\u1ebft na, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, t\u1ea5m l\u00f2ng th\u01a1m th\u1ea3o, ph\u1ea9m ch\u1ea5t cao \u0111\u1eb9p.", "sex": 5}
{"first_name": "huy\u00ean Th\u1ea3o", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t  \"Th\u1ea3o\" th\u01b0\u1eddng ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 v\u1ebb ngo\u00e0i d\u1ecbu d\u00e0ng, mong manh, b\u00ecnh d\u1ecb nh\u01b0ng c\u0169ng r\u1ea5t m\u1ea1nh m\u1ebd, c\u00f3 kh\u1ea3 n\u0103ng sinh t\u1ed3n cao.\"Khuy\u00ean\" th\u1ec3 hi\u1ec7n s\u1ef1 d\u1ecbu d\u00e0ng, nho nh\u00e3, qu\u00fd ph\u00e1i n\u00ean th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho con g\u00e1i v\u1edbi mong mu\u1ed1n b\u00e9 g\u00e1i khi l\u1edbn l\u00ean s\u1ebd lu\u00f4n xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau v\u00e0 \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau m\u1ebfn.\"Khuy\u00ean Th\u1ea3o\" l\u00e0 t\u00ean \u0111\u01b0\u1ee3c ba m\u1eb9 \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd l\u00e0 ng\u01b0\u1eddi hi\u1ebfu th\u1ea3o v\u00e0 hi\u1ec1n l\u00e0nh,c\u00f3 cu\u1ed9c s\u1ed1ng thanh b\u00ecnh, h\u1ea1nh ph\u00fac.", "sex": 5}
{"first_name": "Lam Th\u1ea3o", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Lam\" l\u00e0 t\u00ean g\u1ecdi c\u1ee7a m\u1ed9t lo\u1ea1i ng\u1ecdc th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u01b0a chu\u1ed9ng l\u00e0m trang s\u1ee9c cho c\u00e1c \u0111\u1ea5ng tr\u1ecb v\u00ec Ai C\u1eadp c\u1ed5 \u0111\u1ea1i, Ba T\u01b0, \u1ea4n \u0110\u1ed9... v\u00ec m\u00e0u s\u1eafc \u0111\u1ed9c \u0111\u00e1o c\u1ee7a n\u00f3. Ng\u1ecdc Lam c\u00f2n c\u00f3 t\u00e1c d\u1ee5ng tr\u1ecb b\u1ec7nh, mang l\u1ea1i may m\u1eafn cho ng\u01b0\u1eddi mang n\u00f3.\"Th\u1ea3o\" l\u00e0 c\u1ecf, l\u00e0 s\u1ef1 r\u1ed9ng l\u01b0\u1ee3ng, t\u1ed1t b\u1ee5ng, s\u1ef1 hi\u1ebfu th\u1ea3o. T\u00ean \"Lam Th\u1ea3o\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean r\u1ea5t hay v\u00e0 nh\u1eb9 nh\u00e0ng d\u00f9ng \u0111\u1ec3 g\u1ee3i \u0111\u1ebfn ng\u01b0\u1eddi \u0111\u1eb9p ho\u00e0n h\u1ea3o t\u1eeb ngo\u1ea1i h\u00ecnh \u0111\u1ebfn tinh c\u00e1ch.", "sex": 5}
{"first_name": "Linh Th\u1ea3o", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Linh\" d\u00f9ng \u0111\u1ec3 g\u1ee3i \u0111\u1ebfn nh\u1eefng \u0111i\u1ec1u may m\u1eafn, linh thi\u00eang, \"Th\u1ea3o\" l\u00e0 c\u1ecf, l\u00e0 s\u1ef1 t\u1ed1t b\u1ee5ng, r\u1ed9ng l\u01b0\u1ee3ng, hi\u1ebfu th\u1ea3o. \"Linh Th\u1ea3o\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean lu\u00f4n mang \u0111\u1ebfn may m\u1eafn nh\u01b0 s\u1ef1 che ch\u1edf c\u1ee7a cha m\u1eb9 d\u00e0nh cho con c\u00e1i, mong con lu\u00f4n xinh \u0111\u1eb9p, y\u00eau \u0111\u1eddi, \u0111\u1ea7y s\u1ee9c s\u1ed1ng nh\u01b0 hoa c\u1ecf, th\u01a1m th\u1ea3o v\u00e0 ngoan hi\u1ec1n.", "sex": 5}
{"first_name": "Ly Th\u1ea3o", "meaning": "\"Ly\" l\u00e0 m\u1ed9t trong t\u1ee9 Linh bi\u1ec3u t\u01b0\u1ee3ng cho tr\u00ed tu\u1ec7, \"Th\u1ea3o\" l\u00e0 c\u1ecf, d\u1ecbu d\u00e0ng, mong manh, b\u00ecnh d\u1ecb nh\u01b0ng c\u0169ng r\u1ea5t m\u1ea1nh m\u1ebd, c\u00f3 kh\u1ea3 n\u0103ng sinh t\u1ed3n cao.\r\nNgo\u00e0i ra, \"th\u1ea3o\" c\u00f2n c\u00f3 \u00fd ngh\u0129a l\u00e0 s\u1ef1 hi\u1ec1n th\u1ee5c, t\u1ed1t b\u1ee5ng, ngoan hi\u1ec1n trong t\u1ea5m l\u00f2ng th\u01a1m th\u1ea3o, s\u1ef1 hi\u1ebfu th\u1ea3o. T\u00ean \"Ly Th\u1ea3o\" v\u1edbi \u00fd mu\u1ed1n mong con m\u00ecnh s\u1ebd th\u00f4ng minh, t\u1ecfa h\u01b0\u01a1ng cho \u0111\u1eddi.", "sex": 5}
{"first_name": "Mai Th\u1ea3o", "meaning": "Theo ti\u1ebfng H\u00e1n, \"Th\u1ea3o\" l\u00e0 c\u1ecf. \"Mai\" c\u00f3 th\u1ec3 hi\u1ec3u l\u00e0 t\u00ean c\u1ee7a m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p n\u1edf v\u00e0o m\u1ed7i \u0111\u1ed9 xu\u00e2n v\u1ec1. T\u00ean \"Mai Th\u1ea3o\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn n\u00e9t \u0111\u1eb9p thanh xu\u00e2n, t\u01b0\u01a1i s\u00e1ng c\u1ee7a ng\u01b0\u1eddi con g\u00e1i: e \u1ea5p, d\u1ecbu d\u00e0ng, mong manh, nh\u01b0ng tr\u00e0n \u0111\u1ea7y nh\u1ef1a s\u1ed1ng. C\u00e1i t\u00ean n\u00e0y c\u0169ng mang th\u00f4ng \u0111i\u1ec7p y\u00eau th\u01b0\u01a1ng c\u1ee7a cha m\u1eb9 mong con lu\u00f4n xinh \u0111\u1eb9p, r\u1ea1ng ng\u1eddi nh\u01b0 hoa c\u1ecf m\u00f9a xu\u00e2n.", "sex": 5}
{"first_name": "Minh Th\u1ea3o", "meaning": "Con s\u1ebd anh minh v\u00e0 nh\u1eb9 nh\u00e0ng, d\u1ecbu d\u00e0ng nh\u01b0 c\u00e2y c\u1ecf", "sex": 7}
{"first_name": "M\u1ed9c Th\u1ea3o", "meaning": "\"M\u1ed9c Th\u1ea3o\" ngh\u0129a l\u00e0 c\u00e2y c\u1ecf, c\u00e1c lo\u1ea1i th\u1ef1c v\u1eadt n\u00f3i chung, mang \u00fd ngh\u0129a ba m\u1eb9 mong  con m\u1ec1m m\u1ea1i, nh\u1eb9 nh\u00e0ng nh\u01b0ng l\u1ea1i ti\u1ec1m \u1ea9n s\u1ee9c s\u1ed1ng m\u00e3nh li\u1ec7t, b\u1ec1n b\u1ec9.", "sex": 5}
