{"first_name": "M\u1ef9 Th\u1ea3o", "meaning": "\"M\u1ef9\" c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p, t\u1ed1t l\u00e0nh. \"Th\u1ea3o\" l\u00e0 c\u1ecf. \"M\u1ef9 Th\u1ea3o\" mang \u00fd ngh\u0129a mong con xinh \u0111\u1eb9p nh\u01b0 lo\u00e0i c\u1ecf, tuy m\u1ed9c m\u1ea1c b\u00ecnh d\u1ecb, mong manh nh\u01b0 l\u1ea1i \u1ea9n ch\u1ee9a s\u1ee9c s\u1ed1ng m\u1ea1nh m\u1ebd, ki\u00ean c\u01b0\u1eddng.", "sex": 5}
{"first_name": "Nam Th\u1ea3o", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Th\u1ea3o \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con xinh \u0111\u1eb9p, n\u1ebft na, v\u00f4 t\u01b0, h\u1ed3n nhi\u00ean nh\u01b0ng c\u00e2y c\u1ecf nh\u01b0ng v\u1eabn \u0111\u1ea7y b\u1ea3n l\u0129nh, kh\u00ed ph\u00e1ch", "sex": 7}
{"first_name": "Ng\u00e2n Th\u1ea3o", "meaning": "\"Ng\u00e2n\" l\u00e0 v\u00e0ng, ti\u1ec1n. \"Th\u1ea3o\" l\u00e0 hi\u1ebfu th\u1ea3o, ngoan hi\u1ec1n. \"Ng\u00e2n Th\u1ea3o\" ngh\u0129a l\u00e0 con l\u00e0 \u0111\u1ee9a con ngoan hi\u1ebfu th\u1ea3o c\u1ee7a cha m\u1eb9, mong cho t\u01b0\u01a1ng lai con s\u1ebd gi\u00e0u sang, sung s\u01b0\u1edbng.", "sex": 5}
{"first_name": "Nghi Th\u1ea3o", "meaning": "\"Nghi Th\u1ea3o\", con s\u1ebd l\u00e0 m\u1ed9t c\u00f4 g\u00e1i m\u1ea1nh m\u1ebd, ki\u00ean c\u01b0\u1eddng, xinh \u0111\u1eb9p, uy nghi v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng quy\u1ec1n qu\u00fd.", "sex": 5}
{"first_name": "Nguy\u00ean Th\u1ea3o", "meaning": "Lo\u00e0i hoa m\u1ecdc kh\u1eafp c\u00e1nh \u0111\u1ed3ng. Con l\u00e0 ng\u01b0\u1eddi c\u00f3 s\u1ee9c s\u1ed1ng m\u1ea1nh m\u1ebd, lu\u00f4n xinh \u0111\u1eb9p v\u00e0 y\u00eau ki\u1ec1u", "sex": 7}
{"first_name": "Nguy\u1ec7t Th\u1ea3o", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, nguy\u1ec7t l\u00e0 v\u1ea7ng tr\u0103ng, Tr\u0103ng c\u00f3 v\u1ebb \u0111\u1eb9p v\u00f4 c\u00f9ng b\u00ecnh d\u1ecb, m\u1ed9t v\u1ebb \u0111\u1eb9p kh\u00f4ng c\u1ea7n trang s\u1ee9c, \u0111\u1eb9p m\u1ed9t c\u00e1ch v\u00f4 t\u01b0, h\u1ed3n nhi\u00ean. Tr\u0103ng t\u01b0\u1ee3ng tr\u01b0ng cho v\u1ebb \u0111\u1eb9p h\u1ed3n nhi\u00ean n\u00ean tr\u0103ng ho\u00e0 v\u00e0o thi\u00ean nhi\u00ean, ho\u00e0 v\u00e0o c\u00e2y c\u1ecf. \u0110\u1eb7t con t\u00ean Nguy\u1ec7t Th\u1ea3o l\u00e0 mong con c\u00f3 t\u1ea5m l\u00f2ng th\u01a1m th\u1ea3o, nh\u00e2n h\u1eadu, t\u00e2m h\u1ed3n trong s\u00e1ng, v\u00f4 t\u01b0", "sex": 5}
{"first_name": "Nhi Th\u1ea3o", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, \"Nhi\" c\u00f3 ngh\u0129a l\u00e0 con c\u00e1i, b\u00e9 nh\u1ecf, b\u00e9 b\u1ecfng, \"Th\u1ea3o\" l\u00e0 s\u1ef1 hi\u1ebfu th\u1ea3o, t\u1ed1t b\u1ee5ng, r\u1ed9ng l\u01b0\u1ee3ng. T\u00ean \"Nhi Th\u1ea3o\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i ngoan hi\u1ec1n, hi\u1ebfu th\u1ea3o v\u1edbi cha m\u1eb9.", "sex": 5}
{"first_name": "Nh\u01b0 Th\u1ea3o", "meaning": "Con c\u00f3 t\u1ea5m l\u00f2ng t\u1ed1t, th\u1ea3o hi\u1ec1n.", "sex": 5}
{"first_name": "Nhung Th\u1ea3o", "meaning": "\"Nhung\" c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p, m\u1ec1m m\u1ea1i, d\u1ecbu d\u00e0ng v\u00e0 cao sang nh\u01b0 g\u1ea5m nhung. \"Th\u1ea3o\" c\u00f3 ngh\u0129a l\u00e0 hi\u1ebfu th\u1ea3o, ngoan hi\u1ec1n. \"Nhung Th\u1ea3o\" c\u00f3 ngh\u0129a con l\u00e0 \u0111\u1ee9a con hi\u1ebfu th\u1ea3o, ngoan hi\u1ec1n, xinh \u0111\u1eb9p.", "sex": 5}
