{"first_name": "Quy\u00ean Th\u1ea3o", "meaning": "Ch\u1eef \"Th\u1ea3o\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 c\u00e2y c\u1ecf, c\u00f2n \"Quy\u00ean\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i chim c\u00f3 ti\u1ebfng h\u00f3t hay, l\u1ea3nh l\u00f3t, th\u01b0\u1eddng th\u1ea5y v\u00e0o m\u00f9a h\u00e8. \"Quy\u00ean Th\u1ea3o\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con lu\u00f4n xinh \u0111\u1eb9p, tr\u00e0n \u0111\u1ea7y s\u1ee9c s\u1ed1ng nh\u01b0 c\u1ecf c\u00e2y, lu\u00f4n vui t\u01b0\u01a1i, ho\u1ea1t b\u00e1t.", "sex": 5}
{"first_name": "Thanh Th\u1ea3o", "meaning": "Con s\u1ebd lu\u00f4n t\u01b0\u01a1i t\u1eafn nh\u01b0 th\u1ea3m c\u1ecf xanh", "sex": 5}
{"first_name": "Uy\u00ean Th\u1ea3o", "meaning": "Theo ti\u1ebfng H\u00e1n, \"Uy\u00ean\" l\u00e0 s\u1ef1 s\u00e2u s\u1eafc c\u1ee7a t\u01b0 duy, uy\u00ean b\u00e1c, \"Th\u1ea3o\" l\u00e0 c\u1ecf. \"Uy\u00ean Th\u1ea3o\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean r\u1ea5t nh\u1eb9 nh\u00e0ng, tao nh\u00e3, th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 t\u01b0 duy s\u00e1ng su\u1ed1t, th\u00f4ng minh, t\u00ean n\u00e0y \u0111\u01b0\u1ee3c g\u1eedi g\u1eafm v\u1edbi \u00fd ngh\u0129a v\u1ec1 m\u1ed9t cu\u1ed9c s\u1ed1ng c\u1ee7a m\u1ed9t con ng\u01b0\u1eddi bi\u1ebft c\u1ea3m nh\u1eadn, quan t\u00e2m t\u1edbi m\u1ecdi ng\u01b0\u1eddi, m\u1ecdi th\u1ee9 xung quanh m\u00ecnh.", "sex": 5}
{"first_name": "V\u00e2n Th\u1ea3o", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"V\u00e2n\" l\u00e0 m\u00e2y, mang t\u00ednh nh\u1eb9 nh\u00e0ng. \"Th\u1ea3o\" l\u00e0 c\u1ecf, l\u00e0 s\u1ef1 r\u1ed9ng l\u01b0\u1ee3ng, t\u1ed1t b\u1ee5ng, hi\u1ebfu th\u1ea3o. \"V\u00e2n Th\u1ea3o\" l\u00e0 s\u1ef1 k\u1ebft tinh c\u1ee7a m\u00e2y tr\u1eddi v\u00e0 hoa c\u1ecf. T\u00ean n\u00e0y \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi \u01b0\u1edbc mong con s\u1ebd l\u00e0 c\u00f4 g\u00e1i xinh \u0111\u1eb9p, th\u1ea3o hi\u1ec1n v\u00e0 nh\u1eb9 nh\u00e0ng nh\u01b0 \u0111\u00e1m m\u00e2y tr\u00f4i tr\u00ean tr\u1eddi xanh.", "sex": 5}
{"first_name": "Xoan Th\u1ea3o", "meaning": "\"Th\u1ea3o\" l\u00e0 s\u1ef1 hi\u1ec1n th\u1ee5c, t\u1ed1t b\u1ee5ng, ngoan hi\u1ec1n,hi\u1ebfu th\u1ea3o. \"Xoan Th\u1ea3o\", con l\u00e0 \u0111\u1ee9a con hi\u1ebfu th\u1ea3o, hi\u1ec1n l\u00e0nh t\u1ed1t b\u1ee5ng, l\u00e0 \u0111i\u1ec1u qu\u00fd gi\u00e1 nh\u1ea5t c\u1ee7a ba m\u1eb9.", "sex": 5}
{"first_name": "Xu\u00e2n Th\u1ea3o", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t, \"Th\u1ea3o\" c\u00f3 ngh\u0129a l\u00e0 c\u1ecf, m\u1ed9t lo\u1ea1i th\u1ef1c v\u1eadt g\u1eafn li\u1ec1n v\u1edbi thi\u00ean nhi\u00ean v\u00e0 cu\u1ed9c s\u1ed1ng. T\u00ean \"Xu\u00e2n Th\u1ea3o\" c\u00f3 ngh\u0129a l\u00e0 hoa c\u1ecf m\u00f9a xu\u00e2n, ba m\u1eb9 mong con xinh \u0111\u1eb9p, tr\u00e0n tr\u1ec1 s\u1ee9c s\u1ed1ng.", "sex": 5}
{"first_name": "Y\u00ean Th\u1ea3o", "meaning": "\"Y\u00ean\" l\u00e0 b\u00ecnh y\u00ean, th\u01b0 th\u00e1i; \"Th\u1ea3o\" l\u00e0 c\u1ecf hay c\u00f2n ch\u1ec9 \u0111\u1ebfn s\u1ef1 hi\u1ec1n l\u00e0nh t\u1ed1t b\u1ee5ng, hi\u1ebfu th\u1ea3o. \"Y\u00ean Th\u1ea3o\" l\u00e0 m\u1ed9t t\u00ean hay th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i v\u1edbi mong mu\u1ed1n con c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean, h\u1ea1nh ph\u00fac.", "sex": 5}
{"first_name": "Y\u1ebfn Th\u1ea3o", "meaning": "\"Th\u1ea3o\" l\u00e0 c\u00e2y c\u1ecf, c\u00f2n c\u00f3 ngh\u0129a kh\u00e1c l\u00e0 r\u1ed9ng r\u00e3i. \"Y\u1ebfn Th\u1ea3o\" l\u00e0 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng bao la, y\u00eau th\u01b0\u01a1ng, bi\u1ebft chia s\u1ebb v\u00e0 nh\u01b0\u1eddng nh\u1ecbn cho ng\u01b0\u1eddi kh\u00e1c.", "sex": 5}
{"first_name": "An Th\u1ea1nh", "meaning": "\"An\" theo ngh\u0129a H\u00e1n Vi\u1ec7t c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. V\u00ec v\u1eady khi \u0111\u1eb7t t\u00ean An Th\u1ea1nh cho con, \u0111\u00f3 l\u00e0 l\u00fac ba m\u1eb9 mong mu\u1ed1n con c\u00f3 m\u1ed9t s\u1ed1 m\u1ec7nh may m\u1eafn, tr\u00e1nh m\u1ecdi tai \u01b0\u01a1ng hi\u1ec3m h\u1ecda v\u00e0 lu\u00f4n c\u00f3 s\u1ef1 t\u0129nh l\u1eb7ng c\u1ea7n thi\u1ebft, \u0111\u1ee7 t\u00e0i n\u0103ng, cu\u1ed9c s\u1ed1ng sung t\u00fac, gi\u00e0u sang, \u1ea5m no, h\u1ea1nh ph\u00fac", "sex": 3}
{"first_name": "\u00c2n Th\u1ea1nh", "meaning": "\"\u00c2n\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t tr\u1ea1ng th\u00e1i t\u00ecnh c\u1ea3m \u0111\u1eb9p \u0111\u1ebd c\u1ee7a con ng\u01b0\u1eddi, \"\u00c2n\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 chu \u0111\u00e1o, t\u1ec9 m\u0129 hay c\u00f2n th\u1ec3 hi\u1ec7n s\u1ef1 mang \u01a1n s\u00e2u s\u1eafc tha thi\u1ebft. V\u00ec v\u1eady, t\u00ean \"\u00c2n Th\u1ea1nh\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi g\u1eb7p \u0111\u01b0\u1ee3c nhi\u1ec1u may m\u1eafn, cu\u1ed9c s\u1ed1ng h\u01b0ng th\u1ecbnh, danh l\u1ee3i song to\u00e0n, s\u1ed1ng bi\u1ebft y\u00eau th\u01b0\u01a1ng, lu\u00f4n ghi kh\u1eafc s\u1ef1 gi\u00fap \u0111\u1ee1 ch\u00e2n t\u00ecnh m\u00e0 ng\u01b0\u1eddi kh\u00e1c d\u00e0nh cho m\u00ecnh", "sex": 3}
{"first_name": "\u0110\u1ee9c Th\u1ea1nh", "meaning": "Th\u1ea1ch l\u00e0 \u0111\u00e1. Th\u1ea1ch \u0110\u1ee9c l\u00e0 ng\u01b0\u1eddi c\u00f3 t\u00e0i \u0111\u1ee9c ki\u00ean \u0111\u1ecbnh nh\u01b0 \u0111\u00e1 t\u1ea3ng", "sex": 3}
{"first_name": "Duy Th\u1ea1nh", "meaning": "Duy trong ti\u1ebfng h\u00e1n vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u01b0 duy, suy ngh\u0129 th\u1ea5u \u0111\u00e1o. Ng\u01b0\u1eddi t\u00ean Duy Th\u1ea1nh th\u01b0\u1eddng bi\u1ebft b\u00ecnh t\u0129nh gi\u1ea3i quy\u1ebft v\u1ea5n \u0111\u1ec1 kh\u00f4ng b\u1ed9p ch\u1ed9p h\u00e0nh x\u1eed, c\u00f3 tr\u00ed tu\u1ec7, th\u00f4ng minh & tinh t\u01b0\u1eddng. Cu\u1ed9c s\u1ed1ng h\u01b0ng th\u1ecbnh, v\u1ebb vang, \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi n\u1ec3 tr\u1ecdng, y\u00eau m\u1ebfn", "sex": 3}
{"first_name": "H\u01b0ng Th\u1ea1nh", "meaning": "\"H\u01b0ng\" c\u00f3 ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 tr\u1ed7i d\u1eady theo \u00fd t\u00edch c\u1ef1c, l\u00e0m cho gi\u00e0u c\u00f3, th\u1ecbnh v\u01b0\u1ee3ng & ph\u00e1t tri\u1ec3n h\u01a1n. N\u1eb1m trong nh\u00f3m d\u00e0nh cho t\u01b0\u01a1ng lai, t\u00ean \"H\u01b0ng Th\u1ea1nh\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n m\u1ed9t cu\u1ed9c s\u1ed1ng sung t\u00fac, h\u01b0ng th\u1ecbnh h\u01a1n", "sex": 3}
{"first_name": "Minh Th\u1ea1nh", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, Minh c\u00f2n c\u00f3 ngh\u0129a ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (b\u00ecnh minh) th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. \u0110\u1eb7t con t\u00ean Minh Th\u1ea1nh l\u00e0 mong con c\u00f3 \u0111\u01b0\u1ee3c tr\u00ed tu\u1ec7 tinh th\u00f4ng, cu\u1ed9c s\u1ed1ng gi\u00e0u sang, ph\u00fa qu\u00fd", "sex": 3}
{"first_name": "Ng\u1ecdc Th\u1ea1nh", "meaning": "\"Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh,... th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed. T\u00ean Ng\u1ecdc  Th\u1ea1nh th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o thanh cao, quy\u1ec1n qu\u00fd, \u0111\u01b0\u1ee3c s\u1ed1ng trong vinh hoa ph\u00fa qu\u00fd, \u0111\u01b0\u1ee3c y\u00eau th\u01b0\u01a1ng, k\u00ednh tr\u1ecdng", "sex": 3}
{"first_name": "Ph\u00fa Th\u1ea1nh", "meaning": "Ch\u1eef \"Ph\u00fa\" theo ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 gi\u00e0u c\u00f3, d\u1ed3i d\u00e0o. T\u00ean \"Ph\u00fa Th\u1ea1nh\" th\u01b0\u1eddng th\u1ec3 hi\u1ec7n mong mu\u1ed1n v\u1ec1 m\u1ed9t cu\u1ed9c s\u1ed1ng gi\u00e0u sang, sung t\u00fac. Ngo\u00e0i ra t\u00ean \"Ph\u00fa Th\u1ea1nh\" c\u00f2n c\u00f3 ngh\u0129a kh\u1ecfe m\u1ea1nh, tr\u00e1ng th\u1ecbnh, d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi m\u1ea1nh kh\u1ecfe, c\u01b0\u1eddng tr\u00e1ng, c\u00f3 t\u1ea7m v\u00f3c", "sex": 3}
{"first_name": "Ph\u00fac Th\u1ea1nh", "meaning": "Ch\u1eef  \"Ph\u00fac\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 ch\u1ec9 nh\u1eefng s\u1ef1 t\u1ed1t l\u00e0nh, gi\u00e0u sang, may m\u1eafn. T\u00ean \"Ph\u00fac Th\u1ea1nh\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 ph\u1ea9m ch\u1ea5t t\u1ed1t, lu\u00f4n g\u1eb7p may m\u1eafn, c\u00f3 nhi\u1ec1u c\u01a1 h\u1ed9i t\u1ed1t trong cu\u1ed9c s\u1ed1ng, th\u01b0\u1eddng \u0111\u01b0\u1ee3c qu\u00fd nh\u00e2n gi\u00fap \u0111\u1ee1, \u0111\u00e2y ch\u00ednh l\u00e0 mong mu\u1ed1n m\u00e0 b\u1ea5t c\u1ee9 cha m\u1eb9 n\u00e0o c\u0169ng mong con m\u00ecnh \u0111\u01b0\u1ee3c s\u1ed1ng trong gi\u00e0u sang v\u00e0 g\u1eb7p nhi\u1ec1u may m\u1eafn", "sex": 3}
{"first_name": "Ph\u01b0\u01a1ng Th\u1ea1nh", "meaning": "Th\u1ea1nh l\u00e0 nhi\u1ec1u l\u00ean. Th\u1ea1nh Ph\u01b0\u01a1ng l\u00e0 c\u1ecf th\u01a1m m\u1ecdc r\u1eadm r\u1ea1p, h\u00e0m ngh\u0129a con ng\u01b0\u1eddi h\u1ed9i \u0111\u1ee7 t\u1ed1 ch\u1ea5t t\u1ed1t \u0111\u1eb9p, cu\u1ed9c s\u1ed1ng sung t\u00fac h\u00e0i h\u00f2a", "sex": 3}
{"first_name": "Qu\u1ed1c Th\u1ea1nh", "meaning": "Theo ti\u1ebfng h\u00e1n vi\u1ec7t Qu\u1ed1c l\u00e0 \u0111\u1ea5t n\u01b0\u1edbc, l\u00e0 qu\u1ed1c gia, d\u00e2n t\u1ed9c, mang \u00fd ngh\u0129a to l\u1edbn, nh\u1eb1m g\u1eedi g\u1eafm nh\u1eefng \u0111i\u1ec1u cao c\u1ea3, l\u1edbn lao. T\u00ean Qu\u1ed1c Th\u1ea1nh th\u01b0\u1eddng d\u00f9ng \u0111\u1eb7t t\u00ean cho con trai \u0111\u1ec3 hi v\u1ecdng mai sau c\u00f3 th\u1ec3 l\u00e0m n\u00ean vi\u1ec7c l\u1edbn. \u0110\u1ed3ng th\u1eddi mong con c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng sung t\u00fac, h\u01b0ng th\u1ecbnh", "sex": 3}
{"first_name": "Tu\u1ea5n Th\u1ea1nh", "meaning": "Tu\u1ea5n trong ti\u1ebfng h\u00e1n vi\u1ec7t l\u00e0 ch\u00e0ng trai c\u00f3 di\u1ec7n m\u1ea1o tu\u1ea5n t\u00fa, \u0111a t\u00e0i, t\u1ea1o \u0111\u01b0\u1ee3c \u1ea5n t\u01b0\u1ee3ng v\u00e0 thi\u1ec7n c\u1ea3m v\u1edbi nh\u1eefng ng\u01b0\u1eddi xung quanh. T\u00ean Tu\u1ea5n Th\u1ea1nh d\u00f9ng \u0111\u1ec3 n\u00f3i v\u1ec1 ng\u01b0\u1eddi di\u1ec7n m\u1ea1o tu\u1ea5n t\u00fa, c\u00f3 t\u00e0i n\u0103ng, cu\u1ed9c s\u1ed1ng sung t\u00fac, h\u01b0ng th\u00ecnh, \u0111\u01b0\u1ee3c nhi\u1ec1u qu\u00fd m\u1ebfn, ng\u1ee3i khen", "sex": 3}
{"first_name": "\u0110\u00ecnh Chu\u1ea9n", "meaning": "\u0110\u00ecnh l\u00e0 n\u01a1i l\u00e0m vi\u1ec7c c\u1ee7a k\u1ebb quy\u1ec1n qu\u00fd. \u0110\u00ecnh Chu\u1ea9n l\u00e0 nh\u1eefng quy \u0111\u1ecbnh m\u1eabu m\u1ef1c n\u01a1i quy\u1ec1n qu\u00fd, ng\u1ee5 \u00fd cha m\u1eb9 mong con s\u1ebd tr\u1edf th\u00e0nh ng\u01b0\u1eddi quan tr\u1ecdng, t\u00e0i n\u0103ng, n\u1eafm r\u01b0\u1eddng m\u1ed1i c\u00f4ng vi\u1ec7c x\u00e3 h\u1ed9i.", "sex": 3}
