{"first_name": "Phong Ho\u00e0ng", "meaning": "Theo ng\u00f4n ng\u1eef ti\u1ebfng H\u00e1n, \"Ho\u00e0ng\" l\u00e0 ho\u00e0ng b\u00e0o, \"Phong\" l\u00e0 phong \u1ea5n. \" Phong Ho\u00e0ng \" l\u00e0 phong \u1ea5n ho\u00e0ng b\u00e0o. \u0110\u00e2y l\u00e0 nh\u1eefng t\u1eeb ng\u1eef th\u1eddi x\u01b0a th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 g\u1ee3i l\u00ean h\u00ecnh \u1ea3nh qu\u00fd t\u1ed9c, vua ch\u00faa. Ng\u01b0\u1eddi \u0111\u01b0\u1ee3c mang c\u00e1i t\u00ean \"Ho\u00e0ng Phong\" \u0111\u01b0\u1ee3c g\u1eedi g\u1eafm \u00fd ngh\u0129a l\u00e0 m\u1ed9t cu\u1ed9c s\u1ed1ng quy\u1ec1n qu\u00fd, t\u1ed1t \u0111\u1eb9p.", "sex": 3}
