{"first_name": "T\u1ea5n Ho\u00e0ng", "meaning": "\"Ho\u00e0ng\" trong ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 m\u00e0u v\u00e0ng, \u00e1nh s\u1eafc c\u1ee7a v\u00e0ng v\u00e0 \u1edf m\u1ed9t ngh\u0129a kh\u00e1c th\u00ec \"Ho\u00e0ng\" th\u1ec3 hi\u1ec7n s\u1ef1 nghi\u00eam trang, r\u1ef1c r\u1ee1,huy ho\u00e0ng nh\u01b0 b\u1eadc vua ch\u00faa. \"T\u1ea5n\" v\u1eeba c\u00f3 ngh\u0129a l\u00e0 h\u1ecfi th\u0103m, th\u1ec3 hi\u1ec7n s\u1ef1 quan t\u00e2m, \u00e2n c\u1ea7n, v\u1eeba c\u00f3 ngh\u0129a l\u00e0 ti\u1ebfn l\u00ean, th\u1ec3 hi\u1ec7n s\u1ef1 ph\u00e1t tri\u1ec3n, th\u0103ng ti\u1ebfn. T\u00ean \" T\u1ea5n Ho\u00e0ng\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi v\u0129 \u0111\u1ea1i, c\u00f3 c\u1ed1t c\u00e1ch v\u01b0\u01a1ng gi\u1ea3, v\u1edbi mong mu\u1ed1n t\u01b0\u01a1ng lai ph\u00fa qu\u00fd, sang gi\u00e0u", "sex": 3}
{"first_name": "Th\u1ea1ch Ho\u00e0ng", "meaning": "Trong ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ho\u00e0ng\" l\u00e0 m\u00e0u v\u00e0ng, \u00e1nh s\u1eafc c\u1ee7a v\u00e0ng v\u00e0 \u1edf m\u1ed9t ngh\u0129a kh\u00e1c th\u00ec \"Ho\u00e0ng\" th\u1ec3 hi\u1ec7n s\u1ef1 nghi\u00eam trang, r\u1ef1c r\u1ee1,huy ho\u00e0ng nh\u01b0 b\u1eadc vua ch\u00faa. \"Th\u1ea1ch\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u00e1, n\u00f3i \u0111\u1ebfn nh\u1eefng c\u00f3 t\u00ednh ch\u1ea5t ki\u00ean c\u1ed1, c\u1ee9ng c\u00e1p. T\u1ef1a nh\u01b0 \u0111\u00e1, ng\u01b0\u1eddi t\u00ean \"Th\u1ea1ch\" th\u01b0\u1eddng c\u00f3 th\u1ec3 ch\u1ea5t kh\u1ecfe m\u1ea1nh, \u00fd ch\u00ed ki\u00ean c\u01b0\u1eddng, quy\u1ebft \u0111o\u00e1n, lu\u00f4n gi\u1eef v\u1eefng l\u1eadp tr\u01b0\u1eddng. T\u00ean \"Ho\u00e0ng Th\u1ea1ch\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi v\u0129 \u0111\u1ea1i, c\u00f3 c\u1ed1t c\u00e1ch v\u01b0\u01a1ng gi\u1ea3, v\u1edbi mong mu\u1ed1n t\u01b0\u01a1ng lai ph\u00fa qu\u00fd, sang gi\u00e0u, b\u1ea3n t\u00ednh m\u1ea1nh m\u1ebd, s\u1ed1ng c\u00f3 l\u1eadp tr\u01b0\u1eddng", "sex": 3}
{"first_name": "Th\u00e1i Ho\u00e0ng", "meaning": "\"Ho\u00e0ng\" trong ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 m\u00e0u v\u00e0ng, \u00e1nh s\u1eafc c\u1ee7a v\u00e0ng v\u00e0 \u1edf m\u1ed9t ngh\u0129a kh\u00e1c th\u00ec \"Ho\u00e0ng\" th\u1ec3 hi\u1ec7n s\u1ef1 nghi\u00eam trang, r\u1ef1c r\u1ee1,huy ho\u00e0ng nh\u01b0 b\u1eadc vua ch\u00faa. T\u00ean \" Th\u00e1i Ho\u00e0ng\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi v\u0129 \u0111\u1ea1i, c\u00f3 c\u1ed1t c\u00e1ch v\u01b0\u01a1ng gi\u1ea3, v\u1edbi mong mu\u1ed1n t\u01b0\u01a1ng lai ph\u00fa qu\u00fd, sang gi\u00e0u", "sex": 3}
