{"first_name": "B\u00e1ch Thi", "meaning": "\"Thi\" ngh\u0129a l\u00e0 th\u01a1 ph\u00fa, c\u0169ng c\u00f3 ngh\u0129a l\u00e0 th\u1ec3 hi\u1ec7n ra. \"B\u00e1ch Thi\" \u00e1m ch\u1ec9 ng\u01b0\u1eddi c\u00f3 n\u0103ng l\u1ef1c xu\u1ea5t ch\u00fang, v\u1eeba tr\u00ed tu\u1ec7 v\u1eeba t\u00e0i m\u1ea1o, nh\u01b0 c\u00e2y th\u00f4ng l\u1edbn  \u0111\u1ee9ng hi\u00ean ngang nh\u01b0ng h\u00f2a \u0111\u1ed3ng v\u1edbi mu\u00f4n v\u1eadt.", "sex": 5}
{"first_name": "Ca Thi", "meaning": "\"Ca Thi \" \u00fd ch\u1ec9 c\u00e1c l\u0129nh v\u1ef1c c\u1ee7a ngh\u1ec7 thu\u1eadt. \u0110\u1eb7t t\u00ean n\u00e0y cho con, \u1eaft h\u1eb3n b\u1ed1 m\u1eb9 l\u00e0 ng\u01b0\u1eddi y\u00eau th\u01a1 v\u0103n, ca h\u00e1t v\u1edbi hi v\u1ecdng r\u1eb1ng con s\u1ebd l\u00e0 ng\u01b0\u1eddi kh\u00e9o l\u00e9o, tinh t\u1ebf v\u00e0 c\u00f3 t\u00e2m h\u1ed3n l\u00e3ng m\u1ea1n nh\u01b0 nh\u1eefng \u00e1ng th\u01a1, l\u1eddi v\u0103n.", "sex": 5}
{"first_name": "C\u1ea7m Thi", "meaning": "\"C\u1ea7m Thi\" l\u00e0 m\u1ed9t t\u00ean \u0111\u1eb9p cho c\u00e1i b\u00e9 g\u00e1i, v\u1edbi mong mu\u1ed1n con c\u00f3 n\u0103ng khi\u1ebfu trong \u00e2m nh\u1ea1c v\u00e0 l\u00e0 m\u1ed9t c\u00f4 g\u00e1i xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng.", "sex": 5}
{"first_name": "Giao Thi", "meaning": "\"Thi\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i c\u1ecf c\u00f3 l\u00e1 nh\u1ecf d\u00e0i l\u1ea1i c\u00f3 t\u1eebng k\u1ebd, hoa tr\u1eafng hay \u0111\u1ecf ph\u1edbt, h\u01a1i gi\u1ed1ng nh\u01b0 hoa c\u00fac, m\u1ed7i g\u1ed1c \u0111\u00e2m ra nhi\u1ec1u r\u00f2. Ngo\u00e0i ra Thi c\u00f2n c\u00f3 ngh\u0129a l\u00e0 th\u01a1. \"Giao\" c\u0169ng l\u00e0 t\u00ean 1 lo\u1ea1i c\u1ecf b\u00ecnh d\u1ecb, m\u1ed9c m\u1ea1c nh\u01b0ng c\u00f3 s\u1ee9c s\u1ed1ng m\u1ea1nh m\u1ebd. Ng\u01b0\u1eddi t\u00ean \"Giao Thi\" th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, \u0111\u00e1ng y\u00eau, c\u00f3 s\u1ee9c s\u1ed1ng m\u1ea1nh m\u1ebd, ti\u1ec1m t\u00e0ng.", "sex": 5}
{"first_name": "H\u1ea1 Thi", "meaning": "Theo c\u00e1ch th\u00f4ng th\u01b0\u1eddng, \"H\u1ea1\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u00f9a h\u00e8, m\u1ed9t trong nh\u1eefng m\u00f9a s\u00f4i n\u1ed5i v\u1edbi nhi\u1ec1u ho\u1ea1t \u0111\u1ed9ng vui v\u1ebb c\u1ee7a n\u0103m. T\u00ean \"H\u1ea1 Thi\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 v\u1ebb ngo\u00e0i thu h\u00fat, l\u00e0 trung t\u00e2m c\u1ee7a m\u1ecdi s\u1ef1 v\u1eadt, s\u1ef1 vi\u1ec7c, r\u1ea1ng r\u1ee1 nh\u01b0 m\u00f9a h\u00e8, cu\u1ed9c s\u1ed1ng an vui v\u00e0 may m\u1eafn", "sex": 5}
{"first_name": "H\u1ea1nh Thi", "meaning": "Theo H\u00e1n - Vi\u1ec7t, \"H\u1ea1nh\" th\u1ee9 nh\u1ea5t, c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 ph\u00fac l\u1ed9c, l\u00e0 ph\u01b0\u1edbc l\u00e0nh. Ngh\u0129a th\u1ee9 hai l\u00e0 n\u00f3i v\u1ec1 m\u1eb7t \u0111\u1ea1o \u0111\u1ee9c, t\u00ednh n\u1ebft c\u1ee7a con ng\u01b0\u1eddi. T\u00ean \"H\u1ea1nh Thi\" ch\u1ec9 ng\u01b0\u1eddi xinh \u0111\u1eb9p, m\u1ed9c m\u1ea1c, n\u1ebft na, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, t\u1ea5m l\u00f2ng th\u01a1m th\u1ea3o, ph\u1ea9m ch\u1ea5t cao \u0111\u1eb9p.", "sex": 5}
{"first_name": "H\u01b0\u01a1ng Thi", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"h\u01b0\u01a1ng\" c\u00f3 hai \u00fd ngh\u0129a v\u1eeba ch\u1ec9 l\u00e0 qu\u00ea nh\u00e0, l\u00e0 n\u01a1i ch\u1ed1n x\u01b0a; v\u1eeba ch\u1ec9 m\u00f9i h\u01b0\u01a1ng th\u01a1m. Khi d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean, t\u00ean \"H\u01b0\u01a1ng Thi\" mang \u00fd ngh\u0129a nh\u01b0 v\u1ea7ng th\u01a1 v\u1ec1 qu\u00ea h\u01b0\u01a1ng ng\u1ecdt ng\u00e0o, s\u00e2u l\u1eafng, t\u00ean n\u00e0y th\u01b0\u1eddng \u0111\u01b0\u1ee3c ch\u1ecdn \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho con g\u00e1i th\u1ec3 hi\u1ec7n \u0111\u01b0\u1ee3c s\u1ef1 d\u1ecbu d\u00e0ng, quy\u1ebfn r\u0169, thanh cao v\u00e0 \u0111\u1eb1m th\u1eafm c\u1ee7a ng\u01b0\u1eddi con g\u00e1i", "sex": 5}
{"first_name": "Kh\u00e1nh Thi", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Kh\u00e1nh\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng s\u1ef1 vi\u1ec7c vui m\u1eebng, mang c\u1ea3m gi\u00e1c h\u00e2n hoan, th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 di\u1ec5n t\u1ea3 kh\u00f4ng kh\u00ed trong c\u00e1c bu\u1ed5i ti\u1ec7c, bu\u1ed5i l\u1ec5 \u0103n m\u1eebng. T\u00ean \"Kh\u00e1nh Thi\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, \u0111\u1ee9c h\u1ea1nh, t\u1ed1t \u0111\u1eb9p mang l\u1ea1i c\u1ea3m gi\u00e1c vui t\u01b0\u01a1i, hoan h\u1ec9 cho nh\u1eefng ng\u01b0\u1eddi xung quanh", "sex": 5}
{"first_name": "Minh Thi", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, Minh ch\u1ec9 s\u1ef1 s\u00e1ng su\u1ed1t, th\u00f4ng minh, hi\u1ec3u bi\u1ebft. T\u00ean Minh Thi th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft, xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng", "sex": 5}
{"first_name": "Nam Thi", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Thi \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n b\u00ean c\u1ea1nh v\u1ebb \u0111\u1eb9p \u0111\u00e1ng y\u00eau, con c\u00f2n c\u00f3 \u0111\u01b0\u1ee3c nh\u1eefng ph\u1ea9m ch\u1ea5t t\u1ed1t, hi\u1ec3u l\u00fd l\u1ebd, c\u00f3 t\u1ea5m l\u00f2ng, b\u00e1c \u00e1i, khoan dung", "sex": 7}
{"first_name": "Ng\u1ecdc Thi", "meaning": "\"Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh,... th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed. T\u00ean Ng\u1ecdc Thi th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u1ecfa s\u00e1ng nh\u01b0 h\u00f2n ng\u1ecdc qu\u00fd, mang \u00fd ngh\u0129a l\u00e0 tr\u00e2n b\u1ea3o, l\u00e0 m\u00f3n qu\u00e0 qu\u00fd gi\u00e1 c\u1ee7a t\u1ea1o h\u00f3a", "sex": 5}
{"first_name": "Nguy\u1ec7t Thi", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, nguy\u1ec7t l\u00e0 v\u1ea7ng tr\u0103ng, Tr\u0103ng c\u00f3 v\u1ebb \u0111\u1eb9p v\u00f4 c\u00f9ng b\u00ecnh d\u1ecb, m\u1ed9t v\u1ebb \u0111\u1eb9p kh\u00f4ng c\u1ea7n trang s\u1ee9c, \u0111\u1eb9p m\u1ed9t c\u00e1ch v\u00f4 t\u01b0, h\u1ed3n nhi\u00ean. Tr\u0103ng t\u01b0\u1ee3ng tr\u01b0ng cho v\u1ebb \u0111\u1eb9p h\u1ed3n nhi\u00ean n\u00ean tr\u0103ng ho\u00e0 v\u00e0o thi\u00ean nhi\u00ean, ho\u00e0 v\u00e0o c\u00e2y c\u1ecf. T\u00ean Nguy\u1ec7t Thi mang \u00fd ngh\u0129a v\u1ec1 n\u00e9t \u0111\u1eb9p n\u00ecnh di, n\u00ean th\u01a1 c\u1ee7a ng\u01b0\u1eddi con g\u00e1i  gi\u1ea3n d\u1ecb, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean, hi\u1ec1n l\u00e0nh, \u0111\u1ee9c h\u1ea1nh", "sex": 5}
{"first_name": "Ph\u01b0\u01a1ng Thi", "meaning": "Ch\u1eef  \"Ph\u01b0\u01a1ng\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t ngh\u0129a l\u00e0 h\u01b0\u1edbng, v\u1ecb tr\u00ed, \u0111\u1ea1o l\u00fd. T\u00ean \"Ph\u01b0\u01a1ng\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi bi\u1ebft \u0111\u1ea1o l\u00fd l\u00e0m ng\u01b0\u1eddi, bi\u1ebft ph\u00e2n bi\u1ec7t t\u1ed1t x\u1ea5u, \u0111\u00fang sai. Th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi s\u00e1ng su\u1ed1t, tr\u00ed tu\u1ec7. \u0110\u1eb7t t\u00ean \"Ph\u01b0\u01a1ng Thi\" cha m\u1eb9 mu\u1ed1n con m\u00ecnh s\u1ebd xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, lu\u00f4n l\u00e0m nh\u1eefng \u0111i\u1ec1u t\u1ed1t, bi\u1ebft c\u00e1ch \u0111\u1ed1i nh\u00e2n x\u1eed th\u1ebf, l\u00e0m cha m\u1eb9 y\u00ean l\u00f2ng", "sex": 5}
{"first_name": "Th\u1ea3o Thi", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t, \"Th\u1ea3o\" c\u00f3 ngh\u0129a l\u00e0 c\u1ecf, m\u1ed9t lo\u1ea1i th\u1ef1c v\u1eadt g\u1eafn li\u1ec1n v\u1edbi thi\u00ean nhi\u00ean v\u00e0 cu\u1ed9c s\u1ed1ng.  T\u00ean \"Th\u1ea3o Thi\" th\u01b0\u1eddng ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 v\u1ebb ngo\u00e0i d\u1ecbu d\u00e0ng, mong manh, b\u00ecnh d\u1ecb nh\u01b0ng c\u0169ng r\u1ea5t m\u1ea1nh m\u1ebd,c\u00f3 b\u1ea3n l\u0129nh kh\u00ed ph\u00e1ch, kh\u00f4ng g\u1ee5c ng\u00e3 tr\u01b0\u1edbc kh\u00f3 kh\u0103n\r\nNgo\u00e0i ra, c\u00f2n c\u00f3  t\u1ea5m l\u00f2ng th\u01a1m th\u1ea3o, t\u1ed1t b\u1ee5ng", "sex": 5}
{"first_name": "Xu\u00e2n Thi", "meaning": "\"Xu\u00e2n Thi\" ngh\u0129a l\u00e0 b\u00e0i th\u01a1 t\u00ecnh l\u00e3ng m\u1ea1n m\u00f9a xu\u00e2n, \u00fd ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng.", "sex": 5}
{"first_name": "Y\u1ebfn Thi", "meaning": "\"Y\u1ebfn\" l\u00e0 con chim y\u1ebfn, h\u00e0m \u00fd ch\u1ec9 s\u1ef1 th\u00f4ng minh, nhanh nh\u1eb9n, \u0111\u00e1ng y\u00eau; \"Thi\" c\u00f3 ngh\u0129a l\u00e0 th\u01a1, h\u00e0m \u00fd ch\u1ec9 s\u1ef1 xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng. \"Y\u1ebfn Thi\" l\u00e0 c\u00e1i t\u00ean ba m\u1eb9 \u0111\u1eb7t cho con g\u00e1i v\u1edbi mong mu\u1ed1n con s\u1ebd l\u00e0 m\u1ed9t c\u00f4 g\u00e1i v\u1eeba xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau, v\u1eeba ho\u1ea1t b\u00e1t, th\u00f4ng minh.", "sex": 5}
{"first_name": "\u00c2n Th\u1ebf", "meaning": "\"\u00c2n\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t tr\u1ea1ng th\u00e1i t\u00ecnh c\u1ea3m \u0111\u1eb9p \u0111\u1ebd c\u1ee7a con ng\u01b0\u1eddi, \"\u00c2n\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 chu \u0111\u00e1o, t\u1ec9 m\u0129 hay c\u00f2n th\u1ec3 hi\u1ec7n s\u1ef1 mang \u01a1n s\u00e2u s\u1eafc tha thi\u1ebft. \"\u00c2n Th\u1ebf\" mang \u00fd ngh\u0129a con chi\u0301nh la\u0300 \u00e2n hu\u00ea\u0323 ma\u0300 b\u00f4\u0301 me\u0323 nh\u00e2\u0323n \u0111\u01b0\u01a1\u0323c, la\u0300 tinh tu\u0301y cu\u0309a cu\u00f4\u0323c \u0111\u01a1\u0300i na\u0300y. Ca\u0301i t\u00ean \u00c2n Th\u00ea\u0301 ma\u0300 b\u00f4\u0301 me\u0323 \u0111\u0103\u0323t cho con se\u0303 theo con \u0111i su\u00f4\u0301t cu\u00f4\u0323c \u0111\u01a1\u0300i, \u0111o\u0301 cu\u0303ng la\u0300 ni\u00ea\u0300m t\u01b0\u0323 ha\u0300o, ngu\u00f4\u0300n \u0111\u00f4\u0323ng vi\u00ean m\u00f4\u0303i b\u01b0\u01a1\u0301c con \u0111i.", "sex": 3}
{"first_name": "\u1ea8n Th\u1ebf", "meaning": "\"\u1ea8n\" theo phi\u00ean \u00e2m H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 che d\u1ea5u, kh\u00f4ng ph\u00f4 tr\u01b0\u01a1ng ch\u1ec9 ng\u01b0\u1eddi c\u00f3 t\u00e0i nh\u01b0ng khi\u00eam nh\u01b0\u1eddng. \"Th\u00ea\u0301\" y\u0301 chi\u0309 quy\u00ea\u0300n l\u01b0\u0323c, khi\u0301 kha\u0301i cu\u0309a ng\u01b0\u01a1\u0300i nam nhi.  V\u00ec v\u1eady, b\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean n\u00e0y cho con ng\u1ee5 \u00fd mong mu\u1ed1n con co\u0301 ti\u0301nh ti\u0300nh khi\u00eam nh\u01b0\u01a1\u0300ng, ng\u01b0\u01a1\u0300i ma\u0323nh me\u0303, v\u01b0\u0303ng va\u0300ng trong cu\u00f4\u0323c \u0111\u01a1\u0300i.", "sex": 3}
{"first_name": "B\u00e1 Th\u1ebf", "meaning": "Trong quan ni\u00ea\u0323m truy\u00ea\u0300n th\u00f4\u0301ng cu\u0309a ng\u01b0\u01a1\u0300i ph\u01b0\u01a1ng \u0110\u00f4ng, con trai \u0111\u01b0\u01a1\u0323c xem la\u0300 ng\u01b0\u01a1\u0300i n\u00f4\u0301i do\u0303i t\u00f4ng \u0111\u01b0\u01a1\u0300ng, k\u00ea\u0301 tu\u0323c nh\u01b0\u0303ng \u01b0\u01a1\u0301c m\u01a1 ch\u01b0a tro\u0300n cu\u0309a cha me\u0323. \u0110\u0103\u0323t t\u00ean \"Ba\u0301 Th\u00ea\u0301\" cho con, b\u00f4\u0301 me\u0323 ngu\u0323 y\u0301 mong mu\u00f4\u0301n t\u01b0\u01a1ng lai con sa\u0301ng la\u0323n, la\u0300m n\u00ean nghi\u00ea\u0323p l\u01a1\u0301n t\u01b0\u0323a vi\u0323 th\u00ea\u0301 vua tr\u00ean ngai va\u0300ng", "sex": 3}
{"first_name": "B\u1ea1ch Th\u1ebf", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"Th\u1ebf\" c\u00f3 ngh\u0129a l\u00e0 quy\u1ec1n l\u1ef1c, s\u1ee9c m\u1ea1nh, uy l\u1ef1c. \"B\u1ea1ch\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 tr\u1eafng, s\u00e1ng, m\u00e0u c\u1ee7a \u0111\u1ee9c h\u1ea1nh, t\u1eeb bi, tr\u00ed tu\u1ec7, th\u1ec3 hi\u1ec7n s\u1ef1 thanh cao c\u1ee7a t\u00e2m h\u1ed3n. T\u00ean \"B\u1ea1ch Th\u1ebf\"  th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi kh\u1ecfe m\u1ea1nh, uy nghi, t\u00e0i gi\u1ecfi v\u00e0 c\u00f3 t\u00e2m h\u1ed3n ph\u00fac h\u1eadu, t\u00e2m trong s\u00e1ng, \u0111\u01a1n gi\u1ea3n th\u1eb3ng ngay, s\u1ed1ng t\u1eeb bi.", "sex": 3}
{"first_name": "Bang Th\u1ebf", "meaning": "\"Th\u1ebf\" ngh\u0129a l\u00e0 cu\u1ed9c \u0111\u1eddi. \"Bang Th\u1ebf\" l\u00e0 s\u1ee9c m\u1ea1nh cu\u1ed9c \u0111\u1eddi, ch\u1ec9 v\u00e0o con ng\u01b0\u1eddi t\u00e0i n\u0103ng v\u00e0 ti\u1ebfng t\u0103m l\u1eebng l\u1eaby.", "sex": 3}
{"first_name": "B\u00e0ng Th\u1ebf", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"Th\u1ebf\" c\u00f3 ngh\u0129a l\u00e0 quy\u1ec1n l\u1ef1c, s\u1ee9c m\u1ea1nh, uy l\u1ef1c. \"B\u00e0ng\" c\u00f3 ngh\u0129a l\u1edbn lao, d\u00e0y d\u1eb7n hay c\u00f2n c\u00f3 ngh\u0129a th\u1ecbnh v\u01b0\u1ee3ng. T\u00ean \"B\u00e0ng Th\u1ebf\" th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi kh\u1ecfe m\u1ea1nh, uy nghi, t\u00e0i gi\u1ecfi v\u00e0 c\u00f3 quy\u1ec1n l\u1ef1c trong tay.", "sex": 3}
{"first_name": "B\u0103ng Th\u1ebf", "meaning": "\"B\u0103ng\" theo ngh\u0129a H\u00e1n Vi\u1ec7t  v\u1eeba h\u00e0m \u00fd ch\u1ec9 c\u00e1i l\u1ea1nh b\u0103ng gia\u0301 v\u1eeba di\u1ec5n t\u1ea3 h\u00ecnh \u1ea3nh b\u0103ng tuy\u1ebft tr\u1eafng mu\u1ed1t, ng\u1ecdc ng\u00e0. Ch\u1eef \"Th\u1ebf\" mang ngh\u0129a quy\u1ec1n th\u1ebf, quy\u1ec1n l\u1ef1c. T\u00ean con mang tham v\u1ecdng v\u1ec1 m\u1ed9t quy\u1ec1n l\u1ef1c s\u1ee9c m\u1ea1nh to l\u1edbn c\u00f3 th\u1ec3 t\u1ea1o ra nh\u1eefng \u0111i\u1ec1u v\u0129 \u0111\u1ea1i.  \"B\u0103ng Th\u00ea\u0301\" th\u01b0\u01a1\u0300ng du\u0300ng \u0111\u00ea\u0309 mi\u00eau ta\u0309 ng\u01b0\u01a1\u0300i co\u0301 khi\u0301 ti\u00ea\u0301t thanh cao, th\u00ea\u0309 pha\u0301ch c\u01b0\u01a1\u0300ng tra\u0301ng, ma\u0323nh me\u0303", "sex": 3}
{"first_name": "B\u00ecnh Th\u1ebf", "meaning": "\"B\u00ecnh\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 c\u00f4ng b\u1eb1ng, ngang nhau kh\u00f4ng thi\u00ean l\u1ec7ch, c\u00f4ng ch\u00ednh. Ch\u1eef \"Th\u1ebf\" mang ngh\u0129a quy\u1ec1n th\u1ebf, quy\u1ec1n l\u1ef1c. T\u00ean con mang tham v\u1ecdng v\u1ec1 m\u1ed9t quy\u1ec1n l\u1ef1c s\u1ee9c m\u1ea1nh to l\u1edbn c\u00f3 th\u1ec3 t\u1ea1o ra nh\u1eefng \u0111i\u1ec1u v\u0129 \u0111\u1ea1i.V\u00ec v\u1eady, t\u00ean \"B\u00ecnh Th\u00ea\u0301\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 c\u1ed1t c\u00e1ch, bi\u1ebft ph\u00e2n \u0111\u1ecbnh r\u1ea1ch r\u00f2i, t\u00ednh kh\u00ed \u00f4n h\u00f2a, bi\u1ebft \u0111i\u1ec1u ph\u1ed1i c\u00f4ng vi\u1ec7c, th\u00e1i \u0111\u1ed9 tr\u01b0\u1edbc cu\u1ed9c s\u1ed1ng lu\u00f4n b\u00ecnh t\u0129nh an \u0111\u1ecbnh.", "sex": 3}
