{"first_name": "Ca Th\u1ebf", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"Th\u1ebf\" c\u00f3 ngh\u0129a l\u00e0 quy\u1ec1n l\u1ef1c, s\u1ee9c m\u1ea1nh, uy l\u1ef1c. K\u1ebft h\u1ee3p c\u00f9ng \"Ca\" c\u00f3 ngh\u0129a l\u00e0 ca kh\u00fac. T\u00ean \" Ca Th\u1ebf\" \u00fd ch\u1ec9 mong mu\u1ed1n c\u1ee7a b\u1ed1 m\u1eb9 con s\u1ebd kh\u1ecfe m\u1ea1nh, uy nghi, t\u00e0i gi\u1ecfi v\u00e0 c\u00f3 quy\u1ec1n l\u1ef1c trong tay.", "sex": 3}
