{"first_name": "Phong Th\u1ebf", "meaning": "Ch\u1eef \"Phong\" theo ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 gi\u00f3. T\u00ean Phong Th\u1ebf d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi m\u1ea1nh m\u1ebd, c\u00f3 kh\u1ea3 n\u0103ng l\u00e3nh \u0111\u1ea1o, ch\u1ec9 huy ng\u01b0\u1eddi kh\u00e1c. L\u00e0 ng\u01b0\u1eddi ki\u00ean tr\u00ec, d\u0169ng c\u1ea3m v\u00e0 d\u00e1m ngh\u0129 dam l\u00e0m. T\u00ean \"Phong Th\u1ebf\" l\u00e0 mong mu\u1ed1n c\u1ee7a cha m\u1eb9 mu\u1ed1n con m\u00ecnh kh\u1ecfe m\u1ea1nh nh\u01b0 c\u01a1n gi\u00f3 \u0111\u1ec3 \u0111i b\u1ea5t c\u1ee9 n\u01a1i \u0111\u00e2u, l\u00e0m b\u1ea5t c\u1ee9 \u0111i\u1ec1u g\u00ec con mu\u1ed1n, v\u00e0 \u0111em l\u1ea1i ni\u1ec1m vui, h\u1ea1nh ph\u00fac cho m\u1ecdi ng\u01b0\u1eddi", "sex": 3}
{"first_name": "S\u01a1n Th\u1ebf", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t, \"S\u01a1n\" l\u00e0 n\u00fai, t\u00ednh ch\u1ea5t c\u1ee7a n\u00fai l\u00e0 lu\u00f4n v\u1eefng ch\u00e3i, h\u00f9ng d\u0169ng v\u00e0 tr\u1ea7m t\u0129nh. V\u00ec v\u1eady t\u00ean \"S\u01a1n Th\u1ebf\" g\u1ee3i c\u1ea3m gi\u00e1c oai nghi, b\u1ea3n l\u0129nh, quy\u1ec1n l\u1ef1c c\u00f3 th\u1ec3 l\u00e0 ch\u1ed7 d\u1ef1a v\u1eefng ch\u1eafc an to\u00e0n.", "sex": 3}
