{"first_name": "An Thi\u1ec7n", "meaning": "T\u00ean An theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 m\u1ed9t c\u00e1i t\u00ean nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. \"Thi\u1ec7n\" th\u01b0\u01a1\u0300ng du\u0300ng \u0111\u00ea\u0309 chi\u0309 l\u00e0 ng\u01b0\u1eddi t\u1ed1t, c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, th\u1ec3 hi\u1ec7n t\u00ecnh th\u01b0\u01a1ng bao la b\u00e1c \u00e1i, th\u01b0\u01a1ng ng\u01b0\u1eddi. An Thi\u1ec7n l\u00e0 m\u1ed9t c\u00e1i t\u00ean hay v\u00e0 \u00fd ngh\u0129a,\u1ea9n ch\u1ee9a mong mu\u1ed1n, k\u1ef3 v\u1ecdng c\u1ee7a cha m\u1eb9 v\u00e0o \u0111\u1ee9a con y\u00eau qu\u00fd , th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho c\u00e1c b\u00e9 trai.", "sex": 3}
{"first_name": "\u00c2n Thi\u1ec7n", "meaning": "\"\u00c2n\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 \u00e2n hu\u00ea\u0323 - m\u1ed9t tr\u1ea1ng th\u00e1i t\u00ecnh c\u1ea3m \u0111\u1eb9p \u0111\u1ebd c\u1ee7a con ng\u01b0\u1eddi. \"Thi\u1ec7n\" th\u01b0\u01a1\u0300ng du\u0300ng \u0111\u00ea\u0309 chi\u0309 l\u00e0 ng\u01b0\u1eddi t\u1ed1t, c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, th\u1ec3 hi\u1ec7n t\u00ecnh th\u01b0\u01a1ng bao la b\u00e1c \u00e1i, th\u01b0\u01a1ng ng\u01b0\u1eddi.  \u0110\u0103\u0323t t\u00ean \u00c2n Thi\u00ea\u0323n cho con b\u00f4\u0301 me\u0323 nh\u01b0 th\u00e2\u0300m ca\u0309m \u01a1n tr\u01a1\u0300i \u0111\u00e2\u0301t \u0111a\u0303 ban con cho mi\u0300nh nh\u01b0 \u00e2n hu\u00ea\u0323 l\u01a1\u0301n lao.", "sex": 3}
{"first_name": "B\u00e1 Thi\u1ec7n", "meaning": "\"Ba\u0301\" theo ti\u00ea\u0301ng Ha\u0301n-Vi\u00ea\u0323t co\u0301 nghi\u0303a la\u0300 to l\u01a1\u0301n,  quy\u00ea\u0300n l\u01b0\u0323c. \"Thi\u1ec7n\" l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 khen ng\u1ee3i nh\u1eefng con ng\u01b0\u1eddi c\u00f3 ph\u1ea9m ch\u1ea5t hi\u1ec1n l\u00e0nh, t\u1ed1t b\u1ee5ng, l\u01b0\u01a1ng thi\u1ec7n.  \u0110\u0103\u0323t t\u00ean \"Ba\u0301 Thi\u00ea\u0323n\" cho con, cha me\u0323 ngu\u0323 y\u0301 mong mu\u00f4\u0301n t\u01b0\u01a1ng lai con se\u0303 la\u0300 ta\u0323o n\u00ean tha\u0300nh c\u00f4ng r\u01b0\u0323c r\u01a1\u0303 vi\u0301 t\u01b0\u0323a ngai vua x\u01b0ng ba\u0301 b\u00f4\u0301n ph\u01b0\u01a1ng tr\u01a1\u0300i nh\u01b0ng v\u00e2\u0303n l\u00e2\u0301y ca\u0301i thi\u00ea\u0323n la\u0300m g\u00f4\u0301c \u0111\u00ea\u0309 \u0111\u00f4\u0301i nh\u00e2n x\u01b0\u0309 th\u00ea\u0301", "sex": 3}
{"first_name": "B\u1ea3o Thi\u1ec7n", "meaning": "Ch\u1eef B\u1ea3o theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. Thi\u00ean l\u00e0 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi l\u01b0\u01a1ng thi\u1ec7n, t\u1ed1t b\u1ee5ng, nh\u00e2n \u00e1i. \u0110\u1eb7t con t\u00ean B\u1ea3o Thi\u1ec7n l\u00e0 mong con l\u00e0 ng\u01b0\u1eddi c\u00f3 l\u00f2ng nh\u00e2n \u00e1i, th\u01b0\u01a1ng ng\u01b0\u1eddi, l\u01b0\u01a1ng thi\u1ec7n, t\u1ed1t b\u1ee5ng v\u00e0 c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng gi\u00e0u sang, ph\u00fa qu\u00fd", "sex": 3}
{"first_name": "Bi Thi\u1ec7n", "meaning": "\"Bi Thi\u1ec7n\" c\u00f3 ngh\u0129a l\u00e0 t\u1ea5m bia ghi c\u00f4ng \u0111\u1ee9c, thi\u1ec7n t\u00e2m, ng\u1ee5 \u00fd mong con sau n\u00e0y s\u1ebd tr\u1edf th\u00e0nh g\u01b0\u01a1ng s\u00e1ng v\u1edbi \u0111\u1eddi.", "sex": 3}
{"first_name": "Can Thi\u1ec7n", "meaning": "\"Thi\u1ec7n\" l\u00e0 hi\u1ec1n l\u00e0nh. \"Can Thi\u1ec7n\" l\u00e0 ng\u01b0\u1eddi hi\u1ec1n l\u00e0nh ch\u1ea5t ph\u00e1c, n\u1eafm gi\u1eef \u0111\u1ea1o ngh\u0129a.", "sex": 3}
{"first_name": "Ch\u00ed Thi\u1ec7n", "meaning": "\"Ch\u00ed\" l\u00e0 \u00fd ch\u00ed, ch\u00ed h\u01b0\u1edbng, ch\u1ec9 s\u1ef1 quy\u1ebft t\u00e2m theo \u0111u\u1ed5i m\u1ed9t l\u00fd t\u01b0\u1edfng hay m\u1ee5c ti\u00eau n\u00e0o \u0111\u00f3. \"Thi\u1ec7n\" t\u1ee9c th\u1ea7n th\u00e1i an t\u01b0\u1eddng, ng\u00f4n ng\u1eef th\u00e2n ho\u00e0. \"Ch\u00ed Thi\u1ec7n\" l\u00e0 t\u00ean g\u1ecdi b\u1ed1 m\u1eb9 d\u00e0nh cho con \u0111\u1ec3 h\u01b0\u1edbng con theo l\u1ed1i s\u1ed1ng hi\u1ec1n h\u00f2a, nh\u00e3 nh\u1eb7n v\u1edbi m\u1ecdi ng\u01b0\u1eddi xung quanh.", "sex": 3}
{"first_name": "\u0110\u0103ng Thi\u1ec7n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t  \"Thi\u1ec7n\" c\u00f3 ngh\u0129a l\u00e0 t\u1ed1t l\u00e0nh.\"\u0110\u0103ng\" c\u00f3 ngh\u0129a l\u00e0 ng\u1ecdn \u0111\u00e8n, mang \u00fd ngh\u0129a l\u00e0 s\u1ef1 soi s\u00e1ng, tinh anh.\"\u0110\u0103ng Thi\u1ec7n\" l\u00e0 c\u00e1i t\u00ean th\u1ec3 hi\u1ec7n mong mu\u1ed1n c\u1ee7a ba m\u1eb9 r\u1eb1ng con lu\u00f4n g\u1eb7p \u0111\u01b0\u1ee3c nhi\u1ec1u \u0111i\u1ec1u t\u1ed1t l\u00e0nh trong cu\u1ed9c s\u1ed1ng.", "sex": 3}
{"first_name": "\u0110\u00f4 Thi\u1ec7n", "meaning": "\"Thi\u1ec7n\" l\u00e0 hi\u1ec1n l\u00e0nh, t\u00e0i gi\u1ecfi thu\u1ea7n th\u1ee5c. \"\u0110\u00f4 Thi\u1ec7n\" ch\u1ec9 ng\u01b0\u1eddi gi\u1ecfi giang, n\u1eafm ch\u1eafc vi\u1ec7c c\u1ee7a m\u00ecnh.", "sex": 3}
{"first_name": "\u0110\u1ee9c Thi\u1ec7n", "meaning": "\u0110\u1ee9c t\u1ee9c l\u00e0 ph\u1ea9m h\u1ea1nh, t\u00e1c phong t\u1ed1t \u0111\u1eb9p, quy ph\u1ea1m m\u00e0 con ng\u01b0\u1eddi ph\u1ea3i tu\u00e2n theo, ch\u1ec9 chung nh\u1eefng vi\u1ec7c t\u1ed1t l\u00e0nh l\u1ea5y \u0111\u1ea1o \u0111\u1ec3 l\u1eadp th\u00e2n. T\u00ean \"\u0110\u1ee9c Thi\u1ec7n\" l\u00e0m t\u00f4n l\u00ean nh\u00e2n c\u00e1ch c\u1ee7a m\u1ed9t con ng\u01b0\u1eddi l\u01b0\u01a1ng thi\u1ec7n, khoan dung, c\u00f3 t\u1ea5m l\u00f2ng th\u01a1m th\u1ea3o, t\u1ed1t b\u1ee5ng", "sex": 3}
{"first_name": "Duy Thi\u1ec7n", "meaning": "Duy trong ti\u1ebfng h\u00e1n vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u01b0 duy, suy ngh\u0129 th\u1ea5u \u0111\u00e1o. Ng\u01b0\u1eddi t\u00ean \"Duy Thi\u1ec7n\" th\u01b0\u1eddng bi\u1ebft b\u00ecnh t\u0129nh gi\u1ea3i quy\u1ebft v\u1ea5n \u0111\u1ec1 kh\u00f4ng b\u1ed9p ch\u1ed9p h\u00e0nh x\u1eed, c\u00f3 tr\u00ed tu\u1ec7, th\u00f4ng minh & tinh t\u01b0\u1eddng, c\u00f3 t\u1ea5m l\u00f2ng nh\u00e2n \u00e1i, bao la, y\u00eau th\u01b0\u01a1ng, qu\u00fd m\u1ebfn m\u1ecdi ng\u01b0\u1eddi", "sex": 3}
{"first_name": "Giai Thi\u1ec7n", "meaning": "\"Giai Thi\u1ec7n\" c\u00f3 ngh\u0129a l\u00e0 \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p to\u00e0n v\u1eb9n, ng\u1ee5 \u00fd con l\u00e0 s\u1ef1 to\u00e0n v\u1eb9n c\u1ee7a cu\u1ed9c s\u1ed1ng.", "sex": 3}
{"first_name": "H\u00f9ng Thi\u1ec7n", "meaning": "\"H\u00f9ng\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi d\u0169ng m\u00e3nh, t\u00e0i gi\u1ecfi, \u0111\u00e1ng ng\u01b0\u1ee1ng m\u1ed9. H\u00e0m \u00fd khi \u0111\u1eb7t t\u00ean \"H\u00f9ng Thi\u1ec7n\" cho con l\u00e0 mong mu\u1ed1n con tr\u1edf n\u00ean m\u1ea1nh m\u1ebd, oai v\u1ec7, t\u00e0i n\u0103ng , c\u00f3 t\u1ea5m l\u00f2ng nh\u00e2n h\u1eadu, l\u01b0\u01a1ng thi\u1ec7n", "sex": 3}
{"first_name": "Huy Thi\u1ec7n", "meaning": "Trong ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Huy\" c\u00f3 ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng r\u1ef1c r\u1ee1. \"Thi\u1ec7n\" l\u00e0 l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n \u00e1i, khoan dung. T\u00ean \"Huy Thi\u1ec7n\" th\u1ec3 hi\u1ec7n s\u1ef1 chi\u1ebfu r\u1ecdi c\u1ee7a v\u1ea7ng h\u00e0o quang, cho th\u1ea5y s\u1ef1 k\u1ef3 v\u1ecdng v\u00e0o t\u01b0\u01a1ng lai v\u1ebb vang c\u1ee7a con c\u00e1i", "sex": 3}
{"first_name": "Khi\u00eam Thi\u1ec7n", "meaning": "\"Khi\u00eam Thi\u1ec7n\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t cho b\u00e9 trai v\u1edbi \u00fd ngh\u0129a mong con c\u00f3 s\u1ef1 ki\u00ean \u0111\u1ecbnh v\u1eefng v\u00e0ng, kh\u00f4i ng\u00f4 tu\u1ea5n t\u00fa.", "sex": 3}
{"first_name": "Long Thi\u1ec7n", "meaning": "Long l\u00e0 r\u1ed3ng, bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a tr\u00ed th\u00f4ng minh & th\u1ecbnh v\u01b0\u1ee3ng. Thi\u1ec7n l\u00e0 hi\u1ec1n, l\u00e0 nh\u00e2n t\u1eeb, ch\u1ec9 v\u1ec1 l\u00f2ng t\u1ed1t. Long Thi\u1ec7n l\u00e0 con r\u1ed3ng nh\u00e2n t\u1eeb, c\u00f3 ngh\u0129a con nh\u01b0 con r\u1ed3ng, th\u00f4ng minh, tr\u00ed tu\u1ec7 tinh anh nh\u01b0ng v\u1eabn nh\u00e2n t\u1eeb \u0111\u1ee9c \u0111\u1ed9", "sex": 3}
{"first_name": "Minh Thi\u1ec7n", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"Minh\" c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, hi\u1ec3u bi\u1ebft, s\u00e1ng su\u1ed1t. \"Thi\u1ec7n\" l\u00e0 l\u01b0\u01a1ng thi\u1ec7n, t\u1ed1t l\u00e0nh. T\u00ean \"Minh Thi\u1ec7n\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi th\u00f4ng minh, t\u00e0i gi\u1ecfi, minh m\u1eabn, t\u1ed1t b\u1ee5ng, nh\u00e2n h\u1eadu, c\u00f3 t\u1ea5m l\u00f2ng th\u01a1m th\u1ea3o", "sex": 3}
{"first_name": "My Thi\u1ec7n", "meaning": "\"My\" c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p,  \u0111\u00e1ng y\u00eau. \"Thi\u1ec7n\" l\u00e0 nh\u00e2n t\u1eeb, l\u01b0\u01a1ng thi\u1ec7n. V\u1edbi t\u00ean \"My Thi\u1ec7n\", ba m\u1eb9 mong con c\u00f3 t\u1ea5m l\u00f2ng hi\u1ec1n h\u00f2a, l\u01b0\u01a1ng thi\u1ec7n, dung m\u1ea1o xinh \u0111\u1eb9p, t\u00ednh t\u00ecnh hi\u1ec1n l\u00e0nh, t\u1ed1t b\u1ee5ng.", "sex": 5}
{"first_name": "M\u1ef9 Thi\u1ec7n", "meaning": "V\u1edbi t\u00ean \"M\u1ef9 Thi\u1ec7n\", ba m\u1eb9 mong con c\u00f3 m\u1ed9t t\u1ea5m l\u00f2ng nh\u00e2n h\u1eadu, xinh \u0111\u1eb9p v\u00e0 nh\u00e2n \u00e1i.", "sex": 5}
{"first_name": "Nam Thi\u1ec7n", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Thi\u1ec7n \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n v\u1ec1 s\u1ef1 l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu trong t\u00e2m h\u1ed3n con", "sex": 3}
{"first_name": "Ng\u1ecdc Thi\u1ec7n", "meaning": "\"Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh,... th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed. T\u00ean \"Ng\u1ecdc Thi\u1ec7n\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u1ecfa s\u00e1ng nh\u01b0 h\u00f2n ng\u1ecdc qu\u00fd, t\u1ea5m l\u00f2ng th\u01a1m th\u1ea3o, t\u1ed1t b\u1ee5ng, nh\u00e2n h\u1eadu", "sex": 3}
{"first_name": "Nh\u00e3 Thi\u1ec7n", "meaning": "\"V\u1edbi t\u00ean \"Nh\u00e3 Thi\u1ec7n\" ba m\u1eb9 mong r\u1eb1ng con c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, hi\u1ec1n h\u00f2a, \u0111\u00f4i m\u00f4i con n\u00f3i l\u1eddi nho nh\u00e3 thanh cao.", "sex": 5}
{"first_name": "Nh\u00e2n Thi\u1ec7n", "meaning": "\"Nh\u00e2nThi\u1ec7n\" mang \u00fd ch\u1ec9 ng\u01b0\u1eddi nh\u00e2n h\u1eadu, hi\u1ec1n, t\u1ed1t b\u1ee5ng.", "sex": 3}
{"first_name": "Ph\u00e1c Thi\u1ec7n", "meaning": "\"Thi\u1ec7n\" l\u00e0 \u0111i\u1ec1u l\u00e0nh. \"Ph\u00e1c Thi\u1ec7n\" ch\u1ec9 con ng\u01b0\u1eddi b\u1ea3n ch\u1ea5t l\u01b0\u01a1ng hi\u1ec1n, thu\u1ea7n h\u1eadu.", "sex": 3}
{"first_name": "S\u01a1n Thi\u1ec7n", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t, \"S\u01a1n\" l\u00e0 n\u00fai, t\u00ednh ch\u1ea5t c\u1ee7a n\u00fai l\u00e0 lu\u00f4n v\u1eefng ch\u00e3i, h\u00f9ng d\u0169ng v\u00e0 tr\u1ea7m t\u0129nh. V\u00ec v\u1eady t\u00ean \"S\u01a1n Thi\u1ec7n\" g\u1ee3i c\u1ea3m gi\u00e1c oai nghi, b\u1ea3n l\u0129nh, c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n \u00e1i, c\u00f3 th\u1ec3 l\u00e0 ch\u1ed7 d\u1ef1a v\u1eefng ch\u1eafc an to\u00e0n.", "sex": 3}
{"first_name": "T\u00e2m Thi\u1ec7n", "meaning": "Ch\u1eef  \"T\u00e2m\" theo ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 tr\u00e1i tim, kh\u00f4ng ch\u1ec9 v\u1eady, \"t\u00e2m\" c\u00f2n l\u00e0 t\u00e2m h\u1ed3n, l\u00e0 t\u00ecnh c\u1ea3m, l\u00e0 tinh th\u1ea7n. \"T\u00e2m Thi\u1ec7n\" \u00fd n\u00f3i \u0111\u1ebfn tr\u00e1i tim l\u01b0\u01a1ng thi\u1ec7n. T\u00ean \"T\u00e2m Thi\u1ec7n\" th\u01b0\u1eddng th\u1ec3 hi\u1ec7n mong mu\u1ed1n b\u00ecnh y\u00ean, hi\u1ec1n h\u00f2a, lu\u00f4n h\u01b0\u1edbng thi\u1ec7n, c\u00f3 ph\u1ea9m ch\u1ea5t t\u1ed1t", "sex": 3}
{"first_name": "Uy Thi\u1ec7n", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, \"Thi\u1ec7n\" l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 khen ng\u1ee3i nh\u1eefng con ng\u01b0\u1eddi c\u00f3 ph\u1ea9m ch\u1ea5t hi\u1ec1n l\u00e0nh, t\u1ed1t b\u1ee5ng, l\u01b0\u01a1ng thi\u1ec7n. \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd. \u0110\u1eb7t con t\u00ean \"Ph\u00e1c Thi\u1ec7n\", ba m\u1eb9 mong con s\u1ebd l\u00e0 ng\u01b0\u1eddi t\u1ed1t, bi\u1ebft tu t\u00e2m t\u00edch \u0111\u1ee9c, y\u00eau th\u01b0\u01a1ng m\u1ecdi ng\u01b0\u1eddi.", "sex": 3}
{"first_name": "Uy\u00ean Thi\u1ec7n", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, \"Thi\u1ec7n\" l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 khen ng\u1ee3i nh\u1eefng con ng\u01b0\u1eddi c\u00f3 ph\u1ea9m ch\u1ea5t hi\u1ec1n l\u00e0nh, t\u1ed1t b\u1ee5ng, l\u01b0\u01a1ng thi\u1ec7n.  \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \u0110\u1eb7t con t\u00ean \"Uy\u00ean Thi\u1ec7n\" l\u00e0 mong con s\u1ebd xinh \u0111\u1eb9p, l\u00e0 ng\u01b0\u1eddi t\u1ed1t, bi\u1ebft tu t\u00e2m t\u00edch \u0111\u1ee9c, y\u00eau th\u01b0\u01a1ng m\u1ecdi ng\u01b0\u1eddi.", "sex": 5}
{"first_name": "\u00dd Thi\u1ec7n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thi\u1ec7n\" c\u00f3 ngh\u0129a l\u00e0 hi\u1ec1n l\u00e0nh, t\u1ed1t b\u1ee5ng.\"\u00dd Thi\u1ec7n\" th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng nh\u00e2n h\u1eadu, c\u00f3 c\u00e1i t\u00e2m t\u1ed1t v\u00e0 lu\u00f4n h\u01b0\u1edbng v\u1ec1 nh\u1eefng \u0111i\u1ec1u t\u1ed1t l\u00e0nh, nh\u00e2n \u00e1i.", "sex": 7}
{"first_name": "Y\u00ean Thi\u1ec7n", "meaning": "\"Thi\u1ec7n\" c\u00f3 ngh\u0129a t\u1ed1t l\u00e0nh. \"Y\u00ean Thi\u1ec7n\", con l\u00e0 ng\u01b0\u1eddi mang \u0111\u1ebfn nhi\u1ec1u \u0111i\u1ec1u t\u1ed1t l\u1ea1nh, b\u00ecnh y\u00ean v\u00e0 h\u1ea1nh ph\u00fac cho gia \u0111\u00ecnh.", "sex": 5}
