{"first_name": "Hi\u1ec1n Thanh", "meaning": "\"Hi\u1ec1n\" c\u00f3 ngh\u0129a l\u00e0 hi\u1ec1n t\u1eeb, nh\u00e2n h\u1eadu, hi\u1ec1n l\u00e0nh, \"Thanh\" l\u00e0 trong s\u00e1ng, trong s\u1ea1ch, thanh khi\u1ebft. \"Hi\u1ec1n Thanh\" c\u00f3 ngh\u0129a l\u00e0 hi\u1ec1n t\u1eeb v\u00e0 trong s\u1ea1ch. Cha m\u1eb9 \u0111\u1eb7t t\u00ean con g\u00e1i l\u00e0 \"Hi\u1ec1n Thanh\"  l\u00e0 c\u00f3 \u00fd mong mu\u1ed1n con c\u1ee7a h\u1ecd s\u1ebd c\u00f3 \u0111\u01b0\u1ee3c c\u1ea3 hai \u0111\u1ee9c t\u00ednh tr\u00ean.", "sex": 5}
{"first_name": "H\u01b0\u01a1ng Thanh", "meaning": "\"Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\"H\u01b0\u01a1ng\"\" c\u00f3 ngh\u0129a l\u00e0 m\u00f9i th\u01a1m, h\u01b0\u01a1ng th\u01a1m c\u1ee7a hoa, v\u1eadt ph\u1ea9m l\u00e0m b\u1eb1ng nguy\u00ean li\u1ec7u c\u00f3 tinh d\u1ea7u, kh\u00ed \u0111\u1ed1t t\u1ecfa kh\u00f3i th\u01a1m, \"\"Thanh\"\" l\u00e0 m\u00e0u xanh, trong s\u00e1ng, trong s\u1ea1ch. \"\"H\u01b0\u01a1ng Thanh\"\" c\u00f3 ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m trong s\u1ea1ch, thanh khi\u1ebft, duy\u00ean d\u00e1ng, d\u1ecbu d\u00e0ng, n\u1ebft na, t\u00e2m h\u1ed3n trong s\u00e1ng, lu\u00f4n vui t\u01b0\u01a1i v\u00e0 \u0111\u1ea7y s\u1ee9c s\u1ed1ng.\r\n\"", "sex": 5}
{"first_name": "Kh\u01b0\u01a1ng Thanh", "meaning": "Theo ngh\u0129a H\u00e1n - vi\u1ec7t \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 trong s\u1ea1ch, tinh khi\u1ebft.\"Kh\u01b0\u01a1ng\" mang \u00fd ngh\u0129a nh\u01b0 ch\u1ec9 s\u1ef1 y\u00ean \u1ed5n, an b\u00ecnh ho\u1eb7c \u0111\u01b0\u1ee3c d\u00f9ng khi n\u00f3i \u0111\u1ebfn s\u1ef1 gi\u00e0u c\u00f3, \u0111\u1ee7 \u0111\u1ea7y.\"Kh\u01b0\u01a1ng Thanh\" mang \u00fd ngh\u0129a l\u00e0 mong mu\u1ed1n con c\u00f3 cu\u1ed9c s\u1ed1ng thanh khi\u1ebft, trong s\u1ea1ch an nh\u00e0n c\u00f3 ph\u00fac \u0111\u1ee9c v\u1ec1 sau", "sex": 3}
{"first_name": "Ki\u1ec1u Thanh", "meaning": "Theo ngh\u0129a  H\u00e1n-Vi\u1ec7t  \"Ki\u1ec1u\" c\u00f3 ngh\u0129a l\u00e0 c\u00f4 g\u00e1i \u0111\u1eb9p, v\u1edbi d\u00e1ng d\u1ea5p m\u1ec1m m\u1ea1i \u0111\u00e1ng y\u00eau, \"Thanh\" c\u00f3 ngh\u0129a trong s\u1ea1ch, trong s\u00e1ng, li\u00eam khi\u1ebft. T\u00ean \"Ki\u1ec1u Thanh\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i v\u00f4 c\u00f9ng xinh \u0111\u1eb9p,  d\u1ecbu d\u00e0ng, t\u00e2m h\u1ed3n trong s\u00e1ng, t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n. V\u00e0 \u0111\u1eb7c bi\u1ec7t, lu\u00f4n \u0111\u01b0\u1ee3c c\u01b0ng y\u00eau, chi\u1ec1u chu\u1ed9ng", "sex": 5}
{"first_name": "Lam Thanh", "meaning": "Thanh theo ti\u1ebfng H\u00e1n - Vi\u1ec7t l\u00e0 trong s\u1ea1ch, li\u00eam khi\u1ebft. V\u00e0 lam l\u00e0 m\u00e0u xanh c\u1ee7a lo\u1ea1i ng\u1ecdc may m\u1eafn, cao qu\u00fd. \"Lam Thanh\" mang \u00fd ngh\u0129a con qu\u00fd gi\u00e1 nh\u01b0 lo\u00e0i ng\u1ecdc & xinh \u0111\u1eb9p, tinh t\u1ebf, ph\u1ea9m h\u1ea1nh trong s\u1ea1ch, thanh cao", "sex": 5}
{"first_name": "L\u00e2m Thanh", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"L\u00e2m\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 n\u01a1i t\u1ee5 h\u1ecdp c\u1ee7a s\u1ed1 \u0111\u00f4ng, \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 trong s\u1ea1ch, li\u00eam khi\u1ebft. T\u00ean \"L\u00e2m Thanh\" \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi h\u1ed9i t\u1ee5 c\u00e1c \u0111\u1ee9c t\u00ednh cao qu\u00fd, trong s\u1ea1ch, li\u00eam khi\u1ebft c\u1ee7a b\u1eadc hi\u1ec1n nh\u00e2n", "sex": 3}
{"first_name": "Li\u00eam Thanh", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t \"Li\u00eam\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ee9c t\u00ednh trong s\u1ea1ch, ngay th\u1eb3ng, kh\u00f4ng tham c\u1ee7a ng\u01b0\u1eddi kh\u00e1c, kh\u00f4ng t\u01a1 h\u00e0o c\u1ee7a c\u00f4ng. \u0110\u00e2y l\u00e0 t\u00ean th\u01b0\u1eddng \u0111\u1eb7t cho ng\u01b0\u1eddi con trai v\u1edbi mong mu\u1ed1n con c\u00f3 ph\u1ea9m ch\u1ea5t trong s\u1ea1ch, ngay th\u1eb3ng, kh\u00f4ng tham lam", "sex": 3}
{"first_name": "Li\u00ean Thanh", "meaning": "\"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 hoa sen. Thanh l\u00e0 thanh khi\u1ebft, trong s\u00e1ng. Li\u00ean Thanh c\u00f3 ngh\u0129a l\u00e0 con xinh \u0111\u1eb9p, trong s\u00e1ng, thu\u1ea7n khi\u1ebft, kh\u00f4ng g\u1ee3n ch\u00fat pha t\u1ea1p n\u00e0o nh\u01b0 hoa sen thanh tao.", "sex": 5}
{"first_name": "Loan Thanh", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Loan\" ch\u00ednh l\u00e0 chim Ph\u01b0\u1ee3ng m\u00e1i, m\u1ed9t lo\u00e0i chim th\u1ea7n ti\u00ean linh thi\u00eang trong truy\u1ec1n thuy\u1ebft. \"Loan Thanh\" g\u1ee3i \u0111\u1ebfn h\u00ecnh \u1ea3nh chim loan bay l\u01b0\u1ee3n tr\u00ean b\u1ea7u tr\u1eddi xanh. T\u00ean \"Loan Thanh\" \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, nh\u00e2n c\u00e1ch thanh cao, ph\u1ea9m ch\u1ea5t v\u01b0\u01a1ng gi\u1ea3 & l\u00e0 ng\u01b0\u1eddi t\u00e0i n\u0103ng, \u0111\u1ee9c h\u1ea1nh, ph\u00fac h\u1eadu", "sex": 5}
{"first_name": "Long Thanh", "meaning": "\"Long\" c\u00f3 ngh\u0129a l\u00e0 r\u1ed3ng, \"Thanh\" l\u00e0 m\u00e0u xanh, t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 trong s\u1ea1ch, li\u00eam khi\u1ebft. \"Long Thanh\" l\u00e0 con r\u1ed3ng xanh v\u1edbi \u00fd ngh\u0129a con s\u1ebd t\u1ecfa s\u00e1ng v\u1edbi t\u00e0i n\u0103ng & tr\u00ed tu\u1ec7 phi th\u01b0\u1eddng nh\u01b0 lo\u00e0i r\u1ed3ng linh thi\u00eang v\u00e0 t\u00ednh t\u00ecnh thanh khi\u1ebft, li\u00eam ch\u00ednh", "sex": 3}
{"first_name": "L\u00fd Thanh", "meaning": "Thanh theo ti\u1ebfng H\u00e1n - Vi\u1ec7t l\u00e0 trong s\u1ea1ch, li\u00eam khi\u1ebft. V\u00e0 L\u00fd l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa hay c\u00f2n mang \u00fd ngh\u0129a ng\u01b0\u1eddi s\u1ed1ng ngay th\u1eb3ng, theo l\u1ebd ph\u1ea3i. \"Lyd Thanh\" mang \u00fd ngh\u0129a con l\u00e0 b\u00f4ng hoa xinh \u0111\u1eb9p, m\u1ed9c m\u1ea1c g\u1ea7n g\u0169i & t\u00e2m h\u1ed3n li\u00eam khi\u1ebft, thanh cao", "sex": 5}
{"first_name": "Mai Thanh", "meaning": "\"Mai\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p, n\u1edf v\u00e0o m\u00f9a xu\u00e2n, hoa mai n\u1eb1m trong b\u1ed9 t\u1ee9 qu\u00fd :T\u00f9ng, C\u00fac, Tr\u00fac, Mai, Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thanh\" l\u00e0 m\u00e0u xanh, s\u1ef1 trong s\u00e1ng, thanh khi\u1ebft, tu\u1ed5i tr\u1ebb.  c\u00f3 th\u1ec3 hi\u1ec3u l\u00e0 nh\u00e0nh mai xanh. C\u00e1i t\u00ean \"Mai Thanh\" xu\u1ea5t ph\u00e1t t\u1eeb \u0111i\u1ec3n t\u00edch \"Thanh mai tr\u00fac m\u00e3\", \u0111\u00e2y l\u00e0 c\u00e1i t\u00ean th\u1ec3 hi\u1ec7n m\u1ed9t t\u00ecnh y\u00eau \u0111\u1eb9p \u0111\u1ebd, trong s\u00e1ng v\u00e0 g\u1eafn b\u00f3. T\u00ean \"Mai Thanh\" g\u1ee3i \u0111\u1ebfn h\u00ecnh \u1ea3nh ng\u01b0\u1eddi con g\u00e1i trong s\u00e1ng, d\u1ecbu d\u00e0ng, lu\u00f4n vui v\u1ebb, y\u00eau \u0111\u1eddi.", "sex": 5}
{"first_name": "M\u00e2n Thanh", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t \"Thanh\" ch\u1ec9 m\u00e0u xanh, l\u00e0 m\u1ed9t trong n\u0103m m\u00e0u s\u1eafc c\u01a1 b\u1ea3n. \"M\u00e2n\" c\u00f3 ngh\u0129a l\u00e0 m\u1ed9t th\u1ee9 \u0111\u00e1 qu\u00fd. \"Thanh M\u00e2n\" \u00fd ch\u1ec9 m\u1ed9t lo\u1ea1i \u0111\u00e1 qu\u00fd m\u00e0u xanh hay c\u00f2n g\u1ecdi l\u00e0 ng\u1ecdc th\u1ea1ch - Ng\u1ecdc th\u1ea1ch  l\u00e0 m\u1ed9t lo\u1ea1i \u0111\u00e1 qu\u00fd th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 l\u00e0m v\u1eadt trang s\u1ee9c ho\u1eb7c trang tr\u00ed trong c\u00e1c gia \u0111\u00ecnh qu\u00fd t\u1ed9c, vua ch\u00faa. T\u00ean \"Thanh M\u00e2n\" l\u00e0 mong mu\u1ed1n c\u1ee7a cha m\u1eb9 mong mu\u1ed1n con m\u00ecnh c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac, quy\u1ec1n qu\u00fd, lu\u00f4n t\u1ecfa s\u00e1ng v\u00e0 thu h\u00fat nh\u01b0 vi\u00ean ng\u1ecdc th\u1ea1ch qu\u00fd gi\u00e1", "sex": 3}
{"first_name": "M\u1eabn Thanh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 trong s\u1ea1ch, li\u00eam khi\u1ebft, thanh khi\u1ebft. \"M\u1eabn\" c\u00f3 ngh\u0129a l\u00e0 lanh l\u1ee3i, s\u1eafc b\u00e9n. T\u00ean \"M\u1eabn Thanh\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi  t\u00e0i \u0111\u1ee9c song to\u00e0n. V\u1ebb ngo\u00e0i thanh tao, nh\u00e2n c\u00e1ch li\u00eam khi\u1ebft, c\u00f4ng t\u01b0 ph\u00e2n minh, con \u0111\u01b0\u1eddng c\u00f4ng danh ph\u00e1t tri\u1ec3n b\u1ec1n v\u1eefng. \u0110\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi k\u00ednh n\u1ec3, y\u00eau th\u01b0\u01a1ng.", "sex": 7}
