{"first_name": "M\u1ed9c Thanh", "meaning": "M\u1ed9c l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. Thanh l\u00e0 thanh cao, thu\u1ea7n khi\u1ebft. Thanh M\u1ed9c ngh\u0129a l\u00e0 cha m\u1eb9 mong con t\u00ednh t\u00ecnh hi\u1ec1n h\u1eadu, thu\u1ea7n khi\u1ebft, trong s\u00e1ng, s\u1ed1ng ch\u00e2n th\u1eadt, \u0111\u01a1n gi\u1ea3n, b\u00ecnh d\u1ecb", "sex": 3}
