{"first_name": "M\u1ef9 Thanh", "meaning": "M\u1ef9 c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p, t\u1ed1t l\u00e0nh theo ki\u1ec3u nh\u1eb9 nh\u00e0ng m\u1ec1m m\u1ea1i, Thanh l\u00e0 thanh cao, trong s\u1ea1ch, thanh khi\u1ebft, thanh tao. Thanh \u1ef9y ngh\u0129a l\u00e0 con xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau & thanh tao nh\u1eb9 nh\u00e0ng, t\u00ednh t\u00ecnh thanh cao, thu\u1ea7n khi\u1ebft", "sex": 5}
{"first_name": "Nam Thanh", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Ph\u00e1t \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con t\u00e0i gi\u1ecfi, ki\u00ean c\u01b0\u1eddng, s\u1ed1ng trong s\u1ea1ch, li\u00eam khi\u1ebft, thanh cao", "sex": 3}
