{"first_name": "Ng\u1ecdc Thanh", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t, \"Ng\u1ecdc\" l\u00e0 m\u1ed9t th\u1ee9 \u0111\u00e1 qu\u00fd, \u0111\u1eb9p, \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 m\u00e0u xanh, trong s\u1ea1ch, thanh khi\u1ebft. \"Ng\u1ecdc Thanh\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 \u0111\u1ebfn ng\u1ecdc lam- m\u1ed9t lo\u1ea1i kho\u00e1ng ch\u1ea5t c\u00f3 m\u00e0u t\u1eeb xanh bi\u1ec3n ng\u1ea3 sang m\u00e0u xanh l\u00e1 c\u00e2y. Ng\u1ecdc lam hi\u1ebfm c\u00f3, gi\u00e1 tr\u1ecb v\u00e0 \u0111\u01b0\u1ee3c \u01b0a chu\u1ed9ng, d\u00f9ng l\u00e0m trang s\u1ee9c v\u00e0 trang tr\u00ed t\u1eeb h\u1eb1ng ng\u00e0n n\u0103m nay v\u00ec m\u00e0u s\u1eafc \u0111\u1ed9c \u0111\u00e1o c\u1ee7a n\u00f3. T\u1ef1a nh\u01b0 lo\u00e0i ng\u1ecdc lam qu\u00fd gi\u00e1, ng\u01b0\u1eddi t\u00ean \"Ng\u1ecdc Thanh\" th\u01b0\u1eddng xinh \u0111\u1eb9p, hi\u1ec1n l\u00e0nh v\u00e0 thanh cao, quy\u1ec1n quy\u0301 gi\u1ed1ng nh\u01b0 c\u00e1c c\u00f4 g\u00e1i trong c\u00e1c gia \u0111\u00ecnh qu\u00fd t\u1ed9c th\u1eddi x\u01b0a.", "sex": 5}
{"first_name": "Nguy\u00ean Thanh", "meaning": "Theo ti\u1ebfng H\u00e1n,  \"Nguy\u00ean\" l\u00e0 ngu\u1ed3n g\u1ed1c, \"Thanh\" ngh\u0129a l\u00e0 s\u1ef1 trong s\u00e1ng, thanh khi\u1ebft; \"Nguy\u00ean Thanh\" c\u00f3 ngh\u0129a l\u00e0 ngu\u1ed3n g\u1ed1c trong s\u00e1ng. T\u00ean \"Nguy\u00ean Thanh\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi \u00fd ngh\u0129a mong con s\u1ebd c\u00f3 t\u00e2m h\u1ed3n trong s\u00e1ng, lu\u00f4n vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean, cu\u1ed9c s\u1ed1ng con tr\u00e0n ng\u1eadp ni\u1ec1m vui v\u00e0 ti\u1ebfng c\u01b0\u1eddi.", "sex": 3}
