{"first_name": "Nh\u00e3 Thanh", "meaning": "T\u00ean \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 trong s\u1ea1ch, li\u00eam khi\u1ebft, ch\u1ec9 \u0111\u1ebfn nh\u00e2n c\u00e1ch cao qu\u00fd c\u1ee7a m\u1ed9t con ng\u01b0\u1eddi \u0111\u00e1ng \u0111\u01b0\u1ee3c t\u00f4n tr\u1ecdng, ng\u01b0\u1ee1ng m\u1ed9. K\u1ebft h\u1ee3p v\u1edbi t\u00ean l\u00f3t l\u00e0 \"Nh\u00e3\" ch\u1ec9 s\u1ef1 nh\u00e3 nh\u1eb7n, \u0111\u1eb1m th\u1eafm, \u0111\u1eb9p nh\u01b0ng gi\u1ea3n d\u1ecb, kh\u00f4ng c\u1ea7u k\u1ef3, ph\u00f4 tr\u01b0\u01a1ng. T\u00ean n\u00e0y n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi \u0111\u1eb9p ho\u00e0n h\u1ea3o t\u1eeb t\u00ednh c\u00e1ch \u0111\u1ebfn dung nhan, kh\u00f4ng ai s\u00e1nh b\u1eb1ng", "sex": 5}
