{"first_name": "Ph\u00e1t Thanh", "meaning": "Theo ngh\u0129 H\u00e1n - Vi\u1ec7t, \"Thanh\" l\u00e0 trong s\u1ea1ch, thanh cao, li\u00eam khi\u1ebft. \"Ph\u00e1t\" l\u00e0 h\u01b0ng th\u1ecbnh, ph\u00e1t t\u00e0i. \u0110\u1eb7t con t\u00ean \"Thanh Ph\u00e1t\" l\u00e0 mong con c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng gi\u00e0u sang, ph\u00fa qu\u00fd, kh\u00ed ch\u1ea5t \u0111i\u1ec1m \u0111\u1ea1m, cao sang", "sex": 3}
{"first_name": "Phi Thanh", "meaning": "\"Thanh\" l\u00e0 m\u00e0u xanh c\u1ee7a tu\u1ed5i tr\u1ebb, tu\u1ed5i \u0111\u1ea7y s\u1ee9c m\u1ea1nh v\u00e0 ni\u1ec1m tin y\u00eau v\u00e0o cu\u1ed9c s\u1ed1ng. \"Phi\" l\u00e0 nhanh nh\u01b0 bay. T\u00ean \"Thanh Phi\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi nhanh nh\u1eb9n, tinh anh, tr\u00e0n \u0111\u1ea7y s\u1ee9c s\u1ed1ng, y\u00eau ng\u01b0\u1eddi, y\u00eau \u0111\u1eddi", "sex": 5}
{"first_name": "Phong Thanh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, ch\u1eef \"Thanh\" ngh\u0129a l\u00e0 trong s\u1ea1ch, li\u00eam khi\u1ebft, xinh \u0111\u1eb9p, m\u0129 t\u00fa, \"Phong\" ngh\u0129a l\u00e0 gi\u00f3. \"Duy Phong\" \u00fd n\u00f3i \u0111\u1ebfn nh\u1eefng c\u01a1n gi\u00f3 trong l\u00e0nh, t\u01b0\u01a1i m\u00e1t. T\u00ean \"\u0110\u1ee9c Phong\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 ngo\u1ea1i h\u00ecnh xinh \u0111\u1eb9p, thanh t\u00fa, t\u00e2m h\u1ed3n trong s\u00e1ng. N\u1ebfu l\u00e0m quan s\u1ebd l\u00e0 quan thanh li\u00eam, li\u00eam khi\u1ebft, trong c\u00f4ng vi\u1ec7c lu\u00f4n l\u00e0m vi\u1ec7c r\u00f5 r\u00e0ng minh b\u1ea1ch, v\u00ec th\u1ebf nh\u1eefng ng\u01b0\u1eddi n\u00e0y lu\u00f4n \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi n\u1ec3 tr\u1ecdng v\u00e0 gi\u00fap \u0111\u1ee1 h\u1ecd khi h\u1ecd g\u1eb7p kh\u00f3 kh\u0103n. T\u00ean \"\u0110\u1ee9c Phong\" l\u00e0 mong mu\u1ed1n c\u1ee7a cha m\u1eb9 mu\u1ed1n con m\u00ecnh c\u00f3 t\u00e0i c\u00f3 \u0111\u1ee9c, trung th\u1ef1c, ngay th\u1eb3ng, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau qu\u00fd", "sex": 3}
{"first_name": "Ph\u00fac Thanh", "meaning": "\"Ph\u00fac\" l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng \u0111i\u1ec1u t\u1ed1t l\u00e0nh. \"Thanh\" l\u00e0 m\u00e0u xanh, tu\u1ed5i tr\u1ebb, l\u00e0 trong s\u1ea1ch, li\u00eam khi\u1ebft. T\u00ean \"Thanh Ph\u00fac\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd c\u00f3 \u0111\u01b0\u1ee3c s\u1ee9c kh\u1ecfe, hy v\u1ecdng, g\u1eb7p nhi\u1ec1u may m\u1eafn, an l\u00e0nh trong cu\u1ed9c s\u1ed1ng", "sex": 5}
{"first_name": "Ph\u1ee5ng Thanh", "meaning": "\"Ph\u1ee5ng\" theo ngh\u0129a  H\u00e1n - Vi\u1ec7t l\u00e0 chim ph\u01b0\u1ee3ng -  t\u01b0\u1ee3ng tr\u01b0ng cho b\u1ea7u tr\u1eddi v\u00e0 h\u1ea1nh ph\u00fac. \"Thanh\" l\u00e0 m\u00e0u xanh, s\u1ef1 thanh cao, trong s\u1ea1ch trong c\u1ed1t c\u00e1ch ng\u01b0\u1eddi qu\u00e2n t\u1eed. T\u00ean \"Thanh Ph\u1ee5ng\" d\u00f9ng \u0111\u1ec3 n\u00f3i ng\u01b0\u1eddi c\u00f3 di\u1ec7n m\u1ea1o ho\u00e0n m\u0129, duy\u00ean d\u00e1ng, c\u1ed1t c\u00e1ch trong s\u1ea1ch, thanh cao, c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac v\u00e0 quy\u1ec1n qu\u00fd", "sex": 5}
{"first_name": "Ph\u01b0\u1edbc Thanh", "meaning": "\"Thanh\" l\u00e0 m\u00e0u xanh, l\u00e0 thanh khi\u1ebft, trong s\u1ea1ch. \"Ph\u01b0\u1edbc\" l\u00e0 may m\u1eafn, l\u1ed9c ph\u00fac \u0111\u01b0\u1ee3c tr\u1eddi b\u1ea1n cho ng\u01b0\u1eddi nh\u00e2n \u0111\u1ee9c. T\u00ean \"Thanh Ph\u01b0\u1edbc\" mang \u00fd ngh\u0129a mong con c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean, t\u1ed1t \u0111\u1eb9p, g\u1eb7p nhi\u1ec1u may m\u1eafn, \u0111\u1ed3ng th\u1eddi hy v\u1ecdng con lu\u00f4n s\u1ed1ng trong s\u1ea1ch v\u00e0 thanh cao", "sex": 3}
{"first_name": "Ph\u01b0\u01a1ng Thanh", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t \"Ph\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m c\u1ee7a hoa c\u1ecf, \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 m\u00e0u xanh, trong s\u1ea1ch, thanh khi\u1ebft. \"Ph\u01b0\u01a1ng Thanh\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 \u0111\u1ebfn lo\u00e0i hoa c\u1ecf d\u1ea1i b\u00ean \u0111\u01b0\u1eddng, m\u00e0u xanh bi\u1ebfc trong s\u00e1ng, r\u1ea5t \u0111\u1eb9p, g\u1ee3i c\u1ea3m gi\u00e1c tho\u1ea3i m\u00e1i, thanh m\u00e1t d\u1ec5 ch\u1ecbu cho ng\u01b0\u1eddi nh\u00ecn ng\u1eafm ch\u00fang. T\u00ean \"Ph\u01b0\u01a1ng Thanh\" th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p, t\u00e2m h\u1ed3n trong s\u00e1ng v\u00e0 c\u00f3 s\u1ee9c s\u1ed1ng m\u00e3nh li\u1ec7t, y\u00eau \u0111\u1eddi t\u1ef1a nh\u01b0 lo\u00e0i hoa d\u1ea1i.", "sex": 5}
{"first_name": "Ph\u01b0\u1ee3ng Thanh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thanh\" l\u00e0 trong s\u1ea1ch, thanh cao, li\u00eam khi\u1ebft, \"Ph\u01b0\u1ee3ng\" l\u00e0 t\u00ean g\u1ecdi t\u1eaft c\u1ee7a lo\u00e0i chim \"Ph\u01b0\u1ee3ng Ho\u00e0ng\" , lo\u00e0i chim \"Ph\u01b0\u1ee3ng\" t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 b\u1ea5t di\u1ec7t, s\u1ef1 s\u1ed1ng v\u0129nh c\u1eedu. T\u00ean \"Thanh Ph\u01b0\u1ee3ng\" mang \u00fd ngh\u0129a xinh \u0111\u1eb9p, duy\u00ean d\u00e1ng, thanh cao, c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac v\u00e0 s\u1ee9c s\u1ed1ng tr\u00e0n \u0111\u1ea7y", "sex": 5}
{"first_name": "Qu\u00e2n Thanh", "meaning": "\"Thanh\" l\u00e0 m\u00e0u xanh, trong s\u1ea1ch, thanh cao, li\u00eam khi\u1ebft. \"Qu\u00e2n\" l\u00e0 vua, d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi, t\u00e0i \u0111\u1ee9c v\u1eb9n to\u00e0n, qu\u00e2n t\u1eed, c\u00f3 kh\u00ed ph\u00e1ch. T\u00ean \"Thanh Qu\u00e2n\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, \u0111a t\u00e0i, c\u1ed1t c\u00e1ch \u0111i\u1ec1m \u0111\u1ea1m, thanh cao, \u0111\u00e1ng t\u00f4n tr\u1ecdng", "sex": 3}
