{"first_name": "Ba\u0323ch Ph\u00fac", "meaning": "Ch\u1eef  \"Ph\u00fac\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 ch\u1ec9 nh\u1eefng s\u1ef1 t\u1ed1t l\u00e0nh, gi\u00e0u sang, may m\u1eafn. T\u00ean \"B\u1ea1ch\" mang \u00fd ngh\u0129a ch\u1ec9 ng\u01b0\u1eddi ph\u00fac h\u1eadu, t\u00e2m trong s\u00e1ng, \u0111\u01a1n gi\u1ea3n th\u1eb3ng ngay, s\u1ed1ng t\u1eeb bi & gi\u00e0u tr\u00ed tu\u1ec7. T\u00ean \"Ph\u00fac B\u1ea1ch\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 ph\u1ea9m ch\u1ea5t t\u1ed1t, lu\u00f4n g\u1eb7p may m\u1eafn, c\u00f3 nhi\u1ec1u c\u01a1 h\u1ed9i t\u1ed1t trong cu\u1ed9c s\u1ed1ng, th\u01b0\u1eddng \u0111\u01b0\u1ee3c qu\u00fd nh\u00e2n gi\u00fap \u0111\u1ee1, \u0111\u00e2y ch\u00ednh l\u00e0 mong mu\u1ed1n m\u00e0 b\u1ea5t c\u1ee9 cha m\u1eb9 n\u00e0o c\u0169ng mong con m\u00ecnh \u0111\u01b0\u1ee3c s\u1ed1ng trong gi\u00e0u sang v\u00e0 g\u1eb7p nhi\u1ec1u may m\u1eafn", "sex": 3}
{"first_name": "B\u1ea3o Ph\u00fac", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng, ch\u1eef \"B\u1ea3o\" th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o, \"Ph\u00fac\" c\u00f3 ngh\u0129a l\u00e0 nh\u1eefng \u0111i\u1ec1u t\u1ed1t l\u00e0nh. T\u00ean \"B\u1ea3o Ph\u00fac\" \u0111\u01b0\u1ee3t \u0111\u1eb7t v\u1edbi \u01b0\u1edbc mong c\u1ee7a ba m\u1eb9 mong con s\u1ebd c\u00f3 \u0111\u01b0\u1ee3c m\u1ed9t cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean, h\u1ea1nh ph\u00fac, m\u1ecdi \u0111i\u1ec1u t\u1ed1t l\u00e0nh s\u1ebd \u0111\u1ebfn v\u1edbi con b\u1edfi v\u00ec con ch\u00ednh l\u00e0 b\u00e1u v\u1eadt c\u1ee7a ba m\u1eb9.", "sex": 7}
