{"first_name": "\u0110\u1ea1o Ph\u00fac", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Ph\u00fac\" l\u00e0 ch\u1ec9 nh\u1eefng s\u1ef1 t\u1ed1t l\u00e0nh (g\u1ed3m c\u00f3: gi\u00e0u sang, y\u00ean l\u00e0nh, s\u1ed1ng l\u00e2u, c\u00f3 \u0111\u1ee9c t\u1ed1t, vui h\u1ebft tu\u1ed5i tr\u1eddi), gi\u00e0u sang, may m\u1eafn. T\u00ean \"Ph\u00fac\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 ph\u1ea9m ch\u1ea5t t\u1ed1t, lu\u00f4n g\u1eb7p may m\u1eafn.\"\u0110\u1ea1o\" l\u00e0 con \u0111\u01b0\u1eddng, l\u00e0 h\u01b0\u1edbng \u0111i ch\u1ec9 l\u1ed1i cho con ng\u01b0\u1eddi \u0111i \u0111\u00fang h\u01b0\u1edbng.\"Ph\u00fac \u0110\u1ea1o\" mong mu\u1ed1n con gi\u00e0u sang , an l\u00e0nh h\u1ea1nh ph\u00fac, lu\u00f4n g\u1eb7p may l\u00e0nh trong cu\u1ed9c s\u1ed1ng.", "sex": 3}
