{"first_name": "Ba Thi\u00ean", "meaning": "\"Thi\u00ean\" l\u00e0 ng\u00e0n, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 tr\u1eddi. \"Ba Thi\u00ean\" l\u00e0 ng\u00e0n c\u01a1n s\u00f3ng, ng\u1ee5 \u00fd ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb1m th\u1eafm thi\u1ebft tha, d\u1ecbu d\u00e0ng s\u00e2u s\u1eafc.", "sex": 5}
{"first_name": "B\u00e1 Thi\u00ean", "meaning": "Trong quan ni\u00ea\u0323m truy\u00ea\u0300n th\u00f4\u0301ng cu\u0309a ng\u01b0\u01a1\u0300i ph\u01b0\u01a1ng \u0110\u00f4ng, con trai \u0111\u01b0\u01a1\u0323c xem la\u0300 ng\u01b0\u01a1\u0300i n\u00f4\u0301i do\u0303i t\u00f4ng \u0111\u01b0\u01a1\u0300ng, k\u00ea\u0301 tu\u0323c nh\u01b0\u0303ng \u01b0\u01a1\u0301c m\u01a1 ch\u01b0a tro\u0300n cu\u0309a cha me\u0323. Theo ngh\u0129a  H\u00e1n-Vi\u1ec7t  \"Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eddi,  th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. T\u1ef1a nh\u01b0 b\u1ea7u tr\u1eddi bao la \u1ea5y, ng\u01b0\u1eddi t\u00ean \"Thi\u00ean\" th\u01b0\u1eddng \u0111\u0129nh \u0111\u1ea1c, lu\u00f4n m\u1ea1nh m\u1ebd, c\u00f3 c\u00e1i nh\u00ecn bao qu\u00e1t, t\u1ea7m nh\u00ecn r\u1ed9ng l\u1edbn. \u0110\u0103\u0323t t\u00ean \"Ba\u0301 Thi\u00ean\" cho con, cha me\u0323 ngu\u0323 y\u0301 mong mu\u00f4\u0301n t\u01b0\u01a1ng lai con se\u0303 tung hoa\u0300nh tho\u0309a chi\u0301 nam nhi, x\u01b0ng ba\u0301 kh\u0103\u0301p b\u00f4\u0301n ph\u01b0\u01a1ng. Ngoa\u0300i ra co\u0300n ngu\u0323 y\u0301 con s\u1ebd l\u00e0 \u0111\u1ee9a con t\u00e0i gi\u1ecfi, th\u00f4ng minh v\u00e0 c\u00f3 nh\u1eefng t\u00e0i n\u0103ng thi\u00ean b\u1ea9m.", "sex": 3}
{"first_name": "B\u1ea1ch Thi\u00ean", "meaning": "Theo ngh\u0129a  H\u00e1n-Vi\u1ec7t  \"Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eddi,  th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. T\u00ean \"B\u1ea1ch\" mang \u00fd ngh\u0129a ch\u1ec9 ng\u01b0\u1eddi ph\u00fac h\u1eadu, t\u00e2m trong s\u00e1ng, \u0111\u01a1n gi\u1ea3n th\u1eb3ng ngay, s\u1ed1ng t\u1eeb bi.  T\u1ef1a nh\u01b0 b\u1ea7u tr\u1eddi bao la \u1ea5y,ng\u01b0\u1eddi t\u00ean \"B\u1ea1ch Thi\u00ean\" th\u01b0\u1eddng \u0111\u0129nh \u0111\u1ea1c, lu\u00f4n m\u1ea1nh m\u1ebd, c\u00f3 c\u00e1i nh\u00ecn bao qu\u00e1t, t\u1ea7m nh\u00ecn r\u1ed9ng l\u1edbn. v\u00e0 t\u00e2m h\u1ed3n ngay th\u1eb3ng.", "sex": 3}
{"first_name": "B\u00e0ng Thi\u00ean", "meaning": "Theo ngh\u0129a  H\u00e1n-Vi\u1ec7t  \"Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eddi,  th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la.  \"B\u00e0ng\" c\u00f3 ngh\u0129a l\u1edbn lao, d\u00e0y d\u1eb7n hay c\u00f2n c\u00f3 ngh\u0129a th\u1ecbnh v\u01b0\u1ee3ng. T\u1ef1a nh\u01b0 b\u1ea7u tr\u1eddi bao la \u1ea5y,ng\u01b0\u1eddi t\u00ean \"Thi\u00ean B\u00e0ng\" th\u01b0\u1eddng \u0111\u0129nh \u0111\u1ea1c, lu\u00f4n m\u1ea1nh m\u1ebd, c\u00f3 c\u00e1i nh\u00ecn bao qu\u00e1t, t\u1ea7m nh\u00ecn r\u1ed9ng l\u1edbn.", "sex": 3}
{"first_name": "B\u1ea3o Thi\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"B\u1ea3o\" c\u00f3 ngh\u0129a l\u00e0 v\u1eadt qu\u00fd gi\u00e1, \"Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eddi. \"B\u1ea3o Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 b\u00e1u v\u1eadt, b\u1ea3o b\u1ed1i c\u1ee7a tr\u1eddi. T\u00ean \"B\u1ea3o Thi\u00ean\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi t\u1ea5t c\u1ea3 ni\u1ec1m y\u00eau th\u01b0\u01a1ng c\u1ee7a cha m\u1eb9 d\u00e0nh cho con, mong con lu\u00f4n \u0111\u01b0\u1ee3c y\u00eau th\u01b0\u01a1ng, n\u00e2ng niu nh\u01b0 b\u00e1u v\u1eadt, ngo\u00e0i ra \"B\u1ea3o Thi\u00ean\" c\u00f2n n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi \u0111a t\u00e0i, th\u00f4ng minh.", "sex": 3}
{"first_name": "B\u00edch Thi\u00ean", "meaning": "\"B\u00edch Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 m\u00e0u xanh, trong xanh, m\u00e0u c\u1ee7a thi\u00ean nhi\u00ean. Cha m\u1eb9 \u0111\u1eb7t t\u00ean n\u00e0y cho con v\u1edbi hy v\u1ecdng con lu\u00f4n t\u01b0\u01a1i tr\u1ebb, c\u00f3 t\u01b0\u01a1ng lai s\u00e1ng l\u1ea1ng.", "sex": 5}
{"first_name": "B\u1ed5n Thi\u00ean", "meaning": "Theo ngh\u0129a  H\u00e1n-Vi\u1ec7t  \"Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eddi,  th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. \"B\u1ed5n\" t\u1ee9c  b\u1ea3n l\u0129nh, t\u00e0i n\u0103ng. T\u1ef1a nh\u01b0 b\u1ea7u tr\u1eddi bao la \u1ea5y,ng\u01b0\u1eddi t\u00ean \"B\u1ed5n Thi\u00ean\" th\u01b0\u1eddng \u0111\u0129nh \u0111\u1ea1c, lu\u00f4n m\u1ea1nh m\u1ebd, c\u00f3 c\u00e1i nh\u00ecn bao qu\u00e1t, t\u1ea7m nh\u00ecn r\u1ed9ng l\u1edbn.", "sex": 3}
{"first_name": "B\u1eedu Thi\u00ean", "meaning": "\u0110\u00e2y c\u00f3 th\u1ec3 l\u00e0 m\u1ed9t c\u00e1i t\u00ean g\u1ee3i s\u1ef1 cao qu\u00ed, t\u1ed1t l\u00e0nh. V\u1edbi \"B\u1eedu\" t\u01b0\u01a1ng t\u1ef1 \u00fd ngh\u0129a c\u1ee7a ch\u1eef b\u1ea3o trong b\u1ea3o b\u1ed1i qu\u00fd gi\u00e1, th\u1ec3 hi\u1ec7n s\u1ef1 tr\u00e2n qu\u00fd, y\u00eau th\u01b0\u01a1ng c\u1ee7a m\u1ecdi ng\u01b0\u1eddi d\u00e0nh cho con\r\nT\u1eeb \"Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 ngh\u00ecn, hay ngh\u0129a kh\u00e1c l\u00e0 tr\u1eddi . T\u00ean \"B\u1eedu Thi\u00ean\" ng\u1ee5 \u00fd v\u00ed con nh\u01b0 b\u1eedu b\u1ed1i qu\u00fd gi\u00e1 m\u00e0 \u00f4ng tr\u1eddi ban t\u1eb7ng cho gia \u0111\u00ecnh.", "sex": 3}
{"first_name": "C\u1ea9m Thi\u00ean", "meaning": "Theo ngh\u0129a  H\u00e1n-Vi\u1ec7t,  \"Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eddi,  th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la. \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1.  T\u1ef1a nh\u01b0 b\u1ea7u tr\u1eddi bao la, ng\u01b0\u1eddi t\u00ean \"C\u1ea9m Thi\u00ean\" th\u01b0\u1eddng \u0111\u0129nh \u0111\u1ea1c, lu\u00f4n m\u1ea1nh m\u1ebd, c\u00f3 c\u00e1i nh\u00ecn bao qu\u00e1t, t\u1ea7m nh\u00ecn r\u1ed9ng l\u1edbn v\u00e0  mang v\u1ebb \u0111\u1eb9p d\u1ecbu d\u00e0ng, tinh t\u1ebf.", "sex": 5}
