{"first_name": "\u0110\u1ea1o Thi\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Thi\u00ean\" ngh\u0129a l\u00e0 tr\u1eddi, l\u00e0 \u0111i\u1ec1u linh thi\u00eang , m\u1eb7t kh\u00e1c c\u0169ng c\u00f3 ngh\u0129a l\u00e0 thi\u00ean nhi\u00ean c\u1ee7a cu\u1ed9c s\u1ed1ng.  \"\u0110\u1ea1o\" ngh\u0129a l\u00e0 con \u0111\u01b0\u1eddng, l\u00e0 h\u01b0\u1edbng \u0111i ch\u1ec9 l\u1ed1i cho con ng\u01b0\u1eddi \u0111i \u0111\u00fang h\u01b0\u1edbng. \"\u0110\u1ea1o Thi\u00ean\" l\u00e0 c\u00e1i t\u00ean th\u1ec3 hi\u1ec7n mong mu\u1ed1n c\u1ee7a ba m\u1eb9 r\u1eb1ng con s\u1ebd th\u1eeba h\u01b0\u1edfng v\u00e0 ph\u00e1t huy \u0111\u01b0\u1ee3c nh\u1eefng \u0111\u1ee9c t\u00ednh t\u1ed1t \u0111\u1eb9p,hi\u1ec1n l\u00e0nh m\u00e0 tr\u1eddi ban cho.", "sex": 3}
