{"first_name": "My Thi\u00ean", "meaning": "\"My\" c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p,  \u0111\u00e1ng y\u00eau. \"Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eddi, h\u00e0m \u00fd ch\u1ec9 s\u1ef1 cao r\u1ed9ng, v\u0129 \u0111\u1ea1i. \"My Thi\u00ean\" mang mong mu\u1ed1n c\u1ee7a ba m\u1eb9 r\u1eb1ng  con s\u1ebd xinh \u0111\u1eb9p th\u00f4ng minh, c\u00f3 c\u00e1i nh\u00ecn bao qu\u00e1t r\u1ed9ng l\u1edbn.", "sex": 5}
