{"first_name": "Nam Thi\u00ean", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Thi\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con t\u00e0i gi\u1ecfi, \u0111\u0129nh \u0111\u1ea1c, lu\u00f4n m\u1ea1nh m\u1ebd, c\u00f3 t\u1ea5m nh\u00ecn r\u1ed9ng l\u1edbn. Ngo\u00e0i ra \"Nam Thi\u00ean\" c\u00f2n d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn v\u00f9ng tr\u1eddi \u1edf ph\u00eda nam v\u1edbi kh\u00ed h\u1eadu \u00f4n h\u00f2a, \u1ea5m \u00e1p. N\u00f3i l\u00ean mong mu\u1ed1n cu\u1ed9c \u0111\u1eddi g\u1eb7p nhi\u1ec1u may m\u1eafn thu\u1eadn l\u1ee3i, cu\u1ed9c s\u1ed1ng sung t\u00fac, gi\u00e0u sang", "sex": 3}
{"first_name": "Nga Thi\u00ean", "meaning": "\"Nga Thi\u00ean\",con l\u00e0 lo\u00e0i chim thi\u00ean nga l\u1ed9ng l\u1eaby, cao qu\u00fd.", "sex": 5}
{"first_name": "Ng\u1ecdc Thi\u00ean", "meaning": "Vi\u00ean ng\u1ecdc c\u1ee7a tr\u1eddi. Con lu\u00f4n \u0111\u01b0\u1ee3c qu\u00fd nh\u00e2n b\u1ea3o v\u1ec7, ch\u1edf che. Lu\u00f4n t\u1ecfa s\u00e1ng v\u00e0 th\u00e0nh c\u00f4ng", "sex": 3}
{"first_name": "Nh\u00e3 Thi\u00ean", "meaning": "\"Nh\u00e3\" l\u00e0 nh\u00e3 nh\u1eb7n, tinh t\u1ebf, l\u1ec5 \u0111\u1ed9, \u0111\u1eb9p gi\u1ea3n d\u1ecb, kh\u00f4ng c\u1ea7u k\u1ef3. \"Thi\u00ean\" l\u00e0 tr\u1eddi, ch\u1ec9 s\u1ef1 bao la, r\u1ed9ng l\u1edbn. T\u00ean \"Nh\u00e3 Thi\u00ean\" mang \u00fd ngh\u0129a con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p, m\u1ed9c m\u1ea1c, \u0111\u00e1ng y\u00eau, khi\u00eam nh\u01b0\u1eddng, t\u1ed1t b\u1ee5ng, t\u1ea5m l\u00f2ng nh\u00e2n t\u1eeb, y\u00eau th\u01b0\u01a1ng m\u1ecdi ng\u01b0\u1eddi", "sex": 5}
{"first_name": "Nh\u1eabn Thi\u00ean", "meaning": "\"Nh\u1eabnThi\u00ean\" mang \u00fd ngh\u0129a mong con bi\u1ebft ki\u00ean nh\u1eabn ch\u1ecbu kh\u00f3, suy ngh\u0129 \u0111\u0129nh \u0111\u1ea1c, lu\u00f4n m\u1ea1nh m\u1ebd, c\u00f3 c\u00e1i nh\u00ecn bao qu\u00e1t, r\u1ed9ng l\u1edbn.", "sex": 3}
{"first_name": "Nh\u1ea5t Thi\u00ean", "meaning": "\"Nh\u1ea5t Thi\u00ean\" ngh\u0129a l\u00e0 con l\u00e0 \u0111\u1ee9a con gi\u1ecfi giang c\u1ee7a tr\u1eddi, th\u00f4ng minh t\u00e0i n\u0103ng s\u1ed1 m\u1ed9t.", "sex": 3}
{"first_name": "Ph\u1ea5n Thi\u00ean", "meaning": "Theo ngh\u0129a  H\u00e1n-Vi\u1ec7t  \"Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eddi,  th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la.  \"Ph\u1ea5n\" hay c\u00f2n g\u1ecdi l\u00e0 ph\u1ea5n hoa c\u00f3 m\u00e0u s\u1eafc t\u01b0\u01a1i s\u00e1ng. Ng\u01b0\u1eddi t\u00ean \"Ph\u1ea5n Thi\u00ean\" th\u01b0\u1eddng c\u00f3 n\u00e9t \u0111\u1eb9p tinh kh\u00f4i, d\u1ecbu d\u00e0ng, thanh l\u1ecbch v\u00e0 c\u00f3 t\u00e2m h\u1ed3n trong s\u00e1ng, nh\u00e2n h\u1eadu, c\u00f3 c\u00e1i nh\u00ecn bao qu\u00e1t, t\u1ea7m nh\u00ecn r\u1ed9ng l\u1edbn.", "sex": 5}
{"first_name": "Ph\u00fa Thi\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ph\u00fa\" ngh\u0129a l\u00e0 \u0111\u01b0\u1ee3c cho, \u0111\u01b0\u1ee3c ban ph\u00e1t, \"Thi\u00ean\" ngh\u0129a l\u00e0 tr\u1eddi. \"Ph\u00fa Thi\u00ean\" c\u00f3 ngh\u0129a con ng\u01b0\u1eddi t\u00e0i n\u0103ng \u0111\u01b0\u1ee3c tr\u1eddi ban cho nh\u1eefng t\u01b0 ch\u1ea5t t\u1ed1t v\u1ed1n c\u00f3 ngay t\u1eeb l\u00fac sinh ra, nh\u01b0 \u0111\u01b0\u1ee3c tr\u1eddi ph\u00fa cho. T\u00ean \"Ph\u00fa Thi\u00ean\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd l\u00e0 \u0111\u1ee9a con t\u00e0i gi\u1ecfi, th\u00f4ng minh v\u00e0 c\u00f3 nh\u1eefng t\u00e0i n\u0103ng thi\u00ean b\u1ea9m.", "sex": 3}
