{"first_name": "L\u00e2m Ho\u00e0n", "meaning": "\"Ho\u00e0n\" ch\u1ec9 s\u1ef1 t\u00ecm ki\u1ebfm, t\u00ecm l\u1ea1i nh\u1eefng \u0111i\u1ec1u \u0111\u00e3 qua, g\u1ee3i s\u1ef1 l\u01b0u luy\u1ebfn, nh\u1edb th\u01b0\u01a1ng. Ho\u00e0n L\u00e2m, \u00fd ch\u1ec9 m\u1ed9t ng\u01b0\u1eddi c\u00f3 suy ngh\u0129 s\u00e2u s\u1eafc, thi\u00ean v\u1ec1 t\u00ecnh c\u1ea3m gia \u0111\u00ecnh, d\u00f9 s\u1ef1 nghi\u1ec7p c\u00f3 l\u1edbn m\u1ea1nh nh\u01b0ng v\u1eabn lu\u00f4n nh\u1edb c\u1ed9i ngu\u1ed3n, g\u1ed1c g\u00e1c", "sex": 3}
