{"first_name": "Anh Ph\u1ee5ng", "meaning": "Ph\u1ee5ng l\u00e0 d\u00e2ng l\u00ean, b\u1ed3i ti\u1ebfp. Ph\u1ee5ng Anh l\u00e0 ng\u01b0\u1eddi c\u00f3 th\u00e1i \u0111\u1ed9 t\u00f4n tr\u1ecdng l\u1ecbch s\u1ef1, nghi\u00eam trang th\u00e0nh k\u00ednh mang l\u1ea1i s\u1ef1 t\u1ed1t \u0111\u1eb9p, ho\u00e0n h\u1ea3o th\u00e0nh c\u00f4ng cho ng\u01b0\u1eddi v\u00e0 cho \u0111\u1eddi.", "sex": 7}
{"first_name": "B\u1ea3o Ph\u1ee5ng", "meaning": "Ch\u1eef B\u1ea3o theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. V\u00ec v\u1eady, t\u00ean \"B\u1ea3o Ph\u1ee5ng\"th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con nh\u01b0 h\u00e0m \u00fd con ch\u00ednh l\u00e0 b\u1ea3o v\u1eadt m\u00e0 b\u1ed1 m\u1eb9 lu\u00f4n n\u00e2ng niu, gi\u1eef g\u00ecn. B\u00ean c\u1ea1nh, t\u00ean \"B\u1ea3o Ph\u1ee5ng\" c\u00f2n \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 cu\u1ed9c s\u1ed1ng \u1ea5m \u00eam lu\u00f4n \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng.", "sex": 7}
{"first_name": "\u0110\u1ee9c Ph\u1ee5ng", "meaning": "Ph\u1ee5ng l\u00e0 d\u00e2ng b\u00e0y. Ph\u1ee5ng \u0110\u1ee9c l\u00e0 th\u1edd ph\u1ee5ng \u0111\u1ea1o \u0111\u1ee9c \u00e2n ngh\u0129a", "sex": 3}
{"first_name": "Gia Ph\u1ee5ng", "meaning": "Gia theo ti\u1ebfng H\u00e1n - Vi\u1ec7t  l\u00e0 lo\u00e0i c\u1ecf lau, mang l\u1ea1i \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p, ph\u00fac l\u00e0nh. \"Gia\" trong ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f2n l\u00e0 gia \u0111\u00ecnh, l\u00e0 m\u00e1i nh\u00e0 n\u01a1i m\u1ecdi ng\u01b0\u1eddi sum v\u1ea7y, sinh ho\u1ea1t b\u00ean nhau. T\u00ean \"Gia Ph\u1ee5ng\" c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p, \u01b0u t\u00fa, mang ph\u1ea9m ch\u1ea5t cao qu\u00fd, gi\u00e0u sang", "sex": 3}
{"first_name": "Minh Ph\u1ee5ng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Minh\" ngh\u0129a l\u00e0 hi\u1ec3u bi\u1ebft, s\u00e1ng su\u1ed1t, c\u00f3 tr\u00ed tu\u1ec7, \"Ph\u1ee5ng\" l\u00e0  lo\u00e0i chim ph\u01b0\u1ee3ng, l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a vua ch\u00faa th\u1eddi x\u01b0a c\u0169ng nh\u01b0 l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a \u0111\u1ee9c h\u1ea1nh v\u00e0 v\u1ebb duy\u00ean d\u00e1ng, thanh nh\u00e3. T\u00ean \"Minh Ph\u1ee5ng\" th\u1ec3 hi\u1ec7n m\u1ed9t ng\u01b0\u1eddi kh\u00f4ng ch\u1ec9 c\u00f3 di\u1ec7n m\u1ea1o kh\u00f4i ng\u00f4, tu\u1ea5n t\u00fa m\u00e0 c\u00f2n c\u00f3 m\u1ed9t tr\u00ed th\u00f4ng minh, hi\u1ec3u bi\u1ebft h\u01a1n ng\u01b0\u1eddi.", "sex": 3}
{"first_name": "Ng\u1ecdc Ph\u1ee5ng", "meaning": "\"Ng\u1ecdc Ph\u01b0\u1ee3ng\" \u00fd n\u00f3i \u0111\u1ebfn chim ph\u01b0\u1ee3ng \u0111\u01b0\u1ee3c l\u00e0m b\u1eb1ng ng\u1ecdc r\u1ea5t qu\u00fd gi\u00e1, ch\u1ec9 c\u00f3 nh\u1eefng b\u1eadc qu\u00fd t\u1ed9c, vua ch\u00faa m\u1edbi c\u00f3 \u0111\u01b0\u1ee3c, ngo\u00e0i ra \u0111\u00e2y c\u00f2n l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a h\u1ea1nh ph\u00fac l\u1ee9a \u0111\u00f4i. T\u00ean \"Ng\u1ecdc Ph\u01b0\u1ee3ng\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi xinh \u0111\u1eb9p, sang tr\u1ecdng. Ba m\u1eb9 mong con c\u00f3 cu\u1ed9c s\u1ed1ng gi\u00e0u sang v\u00e0 h\u1ea1nh ph\u00fac, \u1ea5m \u00eam", "sex": 7}
{"first_name": "Nh\u01b0 Ph\u1ee5ng", "meaning": "\"Nh\u01b0\" l\u00e0 t\u1eeb bi\u1ec3u th\u1ecb quan h\u1ec7 t\u01b0\u01a1ng \u0111\u1ed3ng trong s\u1ef1 so s\u00e1nh v\u1ec1 m\u1ed9t m\u1eb7t n\u00e0o \u0111\u00f3: t\u00ednh ch\u1ea5t, m\u1ee9c \u0111\u1ed9, c\u00e1ch th\u1ee9c, h\u00ecnh th\u1ee9c b\u00ean ngo\u00e0i. \"Nh\u01b0 Ph\u1ee5ng\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd xinh \u0111\u1eb9p v\u00e0 c\u1ed1t c\u00e1ch cao sang nh\u01b0 lo\u00e0i ph\u01b0\u1ee3ng ho\u00e0ng, d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi ng\u01b0\u1eddi c\u00f3 di\u1ec7n m\u1ea1o ho\u00e0n m\u0129, duy\u00ean d\u00e1ng, ph\u1ea9m ch\u1ea5t \u0111\u1ee9c h\u1ea1nh, c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac v\u00e0 quy\u1ec1n qu\u00fd", "sex": 5}
