{"first_name": "Thanh Ph\u1ee5ng", "meaning": "\"Ph\u1ee5ng\" theo ngh\u0129a  H\u00e1n - Vi\u1ec7t l\u00e0 chim ph\u01b0\u1ee3ng -  t\u01b0\u1ee3ng tr\u01b0ng cho b\u1ea7u tr\u1eddi v\u00e0 h\u1ea1nh ph\u00fac. \"Thanh\" l\u00e0 m\u00e0u xanh, s\u1ef1 thanh cao, trong s\u1ea1ch trong c\u1ed1t c\u00e1ch ng\u01b0\u1eddi qu\u00e2n t\u1eed. T\u00ean \"Thanh Ph\u1ee5ng\" d\u00f9ng \u0111\u1ec3 n\u00f3i ng\u01b0\u1eddi c\u00f3 di\u1ec7n m\u1ea1o ho\u00e0n m\u0129, duy\u00ean d\u00e1ng, c\u1ed1t c\u00e1ch trong s\u1ea1ch, thanh cao, c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac v\u00e0 quy\u1ec1n qu\u00fd", "sex": 7}
{"first_name": "Th\u01b0 Ph\u1ee5ng", "meaning": "Ch\u1eef th\u01b0 trong ti\u1ebfng h\u00e1n vi\u1ec7t L\u00e0 ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i d\u1ec5 th\u01b0\u01a1ng, xinh \u0111\u1eb9p, \u0111oan trang, c\u00f3 t\u00e2m h\u1ed3n trong s\u00e1ng, r\u1ea5t bao dung v\u00e0 nh\u00e2n h\u1eadu. \"Ph\u1ee5ng\" l\u00e0 lo\u00e0i chim ph\u01b0\u1ee3ng quy\u1ec1n qu\u00fd, cao sang. T\u00ean \"Th\u01b0 Ph\u1ee5ng\" l\u00e0 mong \u01b0\u1edbc v\u1ec1 nhan s\u1eafc ki\u1ec1u di\u1ec5m, thanh t\u00fa, cu\u1ed9c s\u1ed1ng \u00eam \u0111\u1ec1m, sung t\u00fac", "sex": 5}
