{"first_name": "B\u00e0ng Ph\u01b0\u01a1ng", "meaning": "Ch\u1eef  \"Ph\u01b0\u01a1ng\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi bi\u1ebft \u0111\u1ea1o l\u00fd l\u00e0m ng\u01b0\u1eddi, bi\u1ebft ph\u00e2n bi\u1ec7t t\u1ed1t x\u1ea5u, \u0111\u00fang sai. Th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi s\u00e1ng su\u1ed1t, tr\u00ed tu\u1ec7.  \"B\u00e0ng\" c\u00f3 ngh\u0129a l\u1edbn lao, d\u00e0y d\u1eb7n hay c\u00f2n c\u00f3 ngh\u0129a th\u1ecbnh v\u01b0\u1ee3ng. T\u00ean  \"Ph\u01b0\u01a1ng B\u00e0ng\" l\u00e0 mong mu\u1ed1n c\u1ee7a cha m\u1eb9 mu\u1ed1n con m\u00ecnh lu\u00f4n l\u00e0m nh\u1eefng \u0111i\u1ec1u t\u1ed1t, bi\u1ebft c\u00e1ch \u0111\u1ed1i nh\u00e2n x\u1eed th\u1ebf, l\u00e0m cha m\u1eb9 y\u00ean l\u00f2ng", "sex": 7}
