{"first_name": "B\u00ecnh Ph\u01b0\u01a1ng", "meaning": "\u0110\u00e2y l\u00e0 t\u00ean th\u01b0\u1eddng d\u00f9ng \u0111\u1eb7t cho c\u00e1c b\u00e9 v\u1edbi ch\u1eef Ph\u01b0\u01a1ng thu\u1ed9c b\u1ed9 Th\u1ea3o, c\u00f3 ngh\u0129a l\u00e0 \"m\u00f9i th\u01a1m, xinh \u0111\u1eb9p. \"B\u00ecnh\" ch\u1ec9 ng\u01b0\u1eddi c\u00f3 c\u1ed1t c\u00e1ch an \u0111\u1ecbnh, kh\u00ed ch\u1ea5t \u00f4n h\u00f2a. Ng\u01b0\u1eddi t\u00ean \"B\u00ecnh Ph\u01b0\u01a1ng\" l\u00e0 nh\u1eefng ng\u01b0\u1eddi ki\u00ean \u0111\u1ecbnh, s\u1ed1ng c\u00f3 l\u00fd t\u01b0\u1edfng, c\u00f3 \u01b0\u1edbc m\u01a1", "sex": 3}
