{"first_name": "\u1ea8n Nguy\u1ec7t", "meaning": "Nguy\u1ec7t l\u00e0 m\u1eb7t tr\u0103ng, ng\u00e0y th\u00e1ng. \u1ea8n Nguy\u1ec7t l\u00e0 m\u1eb7t tr\u0103ng gi\u1ea5u k\u00edn, h\u00e0m ngh\u0129a c\u00e1i \u0111\u1eb9p k\u00edn \u0111\u00e1o, s\u1ef1 d\u1ecbu d\u00e0ng ho\u00e0n m\u1ef9 kh\u00f4ng b\u1ed9c l\u1ed9 ra.", "sex": 3}
