{"first_name": "Lam Ph\u01b0\u01a1ng", "meaning": "\"Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\"Lam Ph\u01b0\u01a1ng\"\" d\u00f9ng n\u00f3i \u0111\u1ebfn c\u00e1i t\u00fai th\u01a1m, c\u00e1i l\u00e0n d\u00f9ng \u0111\u1ec3 l\u01b0u gi\u1eef h\u01b0\u01a1ng th\u01a1m, s\u00e2u xa l\u00e0 ch\u1ec9 h\u01b0\u01a1ng th\u01a1m b\u1ec1n l\u00e2u. \r\nCha m\u1eb9 \u0111\u1eb7t t\u00ean Lam Ph\u01b0\u01a1ng cho con v\u1edbi \u00fd ngh\u0129a mong cho con lu\u00f4n gi\u1eef g\u00ecn \u0111\u01b0\u1ee3c s\u1ef1 t\u01b0\u01a1i tr\u1ebb v\u00e0 \u0111\u1ee9c h\u1ea1nh b\u1ec1n l\u00e2u.\"", "sex": 5}
{"first_name": "L\u00e2m Ph\u01b0\u01a1ng", "meaning": "\"L\u00e2m\" l\u00e0 \u0111\u1ebfn. \"L\u00e2m Ph\u01b0\u01a1ng\" l\u00e0 \u0111i\u1ec3m \u0111i \u0111\u1ebfn, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi c\u00f3 b\u1ea3n l\u0129nh t\u00e0i n\u0103ng \u0111\u1eb7c bi\u1ec7t.", "sex": 3}
{"first_name": "Lan Ph\u01b0\u01a1ng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Lan\" l\u00e0 c\u00e2y hoa lan- gi\u1ed1ng hoa ca\u0309nh r\u1ea5t qu\u00fd, c\u00f3 nhi\u1ec1u lo\u1ea1i, th\u00e2n c\u1ecf, l\u00e1 th\u01b0\u1eddng d\u00e0i v\u00e0 h\u1eb9p, hoa \u0111\u1eb9p th\u01b0\u1eddng c\u00f3 h\u01b0\u01a1ng th\u01a1m, \"Ph\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m. \"Lan Ph\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m c\u1ee7a hoa lan- r\u1ea5t th\u01a1m, v\u00e2\u0323y n\u00ean d\u1ea7u th\u01a1m c\u0169ng \u0111\u01b0\u01a1\u0323c g\u1ecdi l\u00e0 \"lan du\". T\u00ean \"Lan Ph\u01b0\u01a1ng\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, \u0111\u1eb1m th\u1eafm, n\u1ebft na, duy\u00ean d\u00e1ng, v\u1edbi t\u00ednh c\u00e1ch ngoan hi\u1ec1n, \u0111\u1ee9c h\u1ea1nh n\u00ean lu\u00f4n \u0111\u01b0\u1ee3c y\u00eau th\u01b0\u01a1ng, chi\u1ec1u chu\u1ed9ng.", "sex": 5}
{"first_name": "Li\u00ean Ph\u01b0\u01a1ng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Li\u00ean\" c\u00f3 ngh\u0129a l\u00e0 b\u00f4ng sen, hoa sen- m\u1ed9t lo\u1ea1i hoa bi\u1ec3u t\u01b0\u1ee3ng cho v\u1ebb \u0111\u1eb9p trong s\u00e1ng, thu\u1ea7n khi\u1ebft v\u00e0 thanh cao. Hoa sen th\u01b0\u1eddng m\u1ecdc \u1edf ao h\u1ed3, \u0111\u1ea7m l\u1ea7y v\u00e0 n\u1edf v\u00e0o m\u00f9a H\u1ea1. Hoa c\u00f3 nh\u1ecb v\u00e0ng, c\u00e1nh hoa m\u00e0u tr\u1eafng ho\u1eb7c h\u1ed3ng, tuy s\u1ed1ng d\u01b0\u1edbi b\u00f9n nh\u01a1 nh\u01b0ng v\u1eabn t\u1ecfa h\u01b0\u01a1ng th\u01a1m nga\u0301t, d\u1ecbu d\u00e0ng. \"Li\u00ean Ph\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 b\u00f4ng sen th\u01a1m hay v\u00f9ng tr\u1eddi \u0111\u1ea7y hoa sen. T\u00ean \"Li\u00ean Ph\u01b0\u01a1ng\" g\u1ee3i l\u00ean v\u1ebb \u0111\u1eb9p thu\u1ea7n khi\u1ebft, thanh cao, trong s\u00e1ng v\u00e0 \u0111\u1ea7y b\u1ea3n l\u0129nh.", "sex": 5}
{"first_name": "Linh Ph\u01b0\u01a1ng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Linh\" c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u1eb9n, th\u00f4ng minh, lanh l\u1ee3i, \"Ph\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m d\u1ecbu d\u00e0ng c\u1ee7a c\u1ecf hoa. T\u00ean \"Linh Ph\u01b0\u01a1ng\" l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p lung linh nh\u01b0 m\u1ed9t b\u00f4ng hoa th\u01a1m, v\u1eeba th\u00f4ng minh, nhanh nh\u1eb9n, nh\u1ea1y b\u00e9n.", "sex": 5}
{"first_name": "Loan Ph\u01b0\u01a1ng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Loan\" l\u00e0 chim loan- theo truy\u1ec1n thuy\u1ebft l\u00e0 m\u1ed9t lo\u00e0i chim th\u1ea7n ti\u00ean, gi\u1ed1ng nh\u01b0 ph\u01b0\u1ee3ng ho\u00e0ng. \"Loan Ph\u01b0\u01a1ng\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i chim qu\u00fd, v\u00f3c d\u00e1ng tao nh\u00e3, ch\u1ec9 \u0103n s\u01b0\u01a1ng mai, \u0103n c\u00e2y tr\u00fac t\u01b0\u01a1i non, ng\u1ee7 tr\u00ean c\u00e2y ng\u00f4 \u0111\u1ed3ng ng\u00e0n n\u0103m. T\u00ean \"Loan Ph\u01b0\u01a1ng\" d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho b\u00e9 g\u00e1i v\u1edbi mong \u01b0\u1edbc con s\u1ebd xinh \u0111\u1eb9p, thanh cao, cu\u1ed9c s\u1ed1ng c\u1ee7a con s\u1ebd lu\u00f4n g\u1eb7p nh\u1eefng \u0111i\u1ec1u may m\u1eafn v\u00e0 \u0111\u01b0\u1ee3c y\u00eau th\u01b0\u01a1ng.", "sex": 5}
{"first_name": "L\u1ed9c Ph\u01b0\u01a1ng", "meaning": "\"L\u1ed9c\" l\u00e0 quy\u1ec1n l\u1ee3i. \"L\u1ed9c Ph\u01b0\u01a1ng\" ch\u1ec9 con ng\u01b0\u1eddi c\u00f3 s\u1ed1 ph\u1eadn may m\u1eafn, v\u1ecb tr\u00ed cao sang.", "sex": 3}
{"first_name": "Long Ph\u01b0\u01a1ng", "meaning": "Long l\u00e0 r\u1ed3ng, bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a tr\u00ed th\u00f4ng minh & th\u1ecbnh v\u01b0\u1ee3ng. Ph\u01b0\u01a1ng l\u00e0 t\u1ee9 h\u01b0\u1edbng, \u0111\u01b0\u1eddng \u0111i, ph\u01b0\u01a1ng h\u01b0\u1edbng. \"Ph\u01b0\u01a1ng Long\" mang \u00fd ngh\u0129a con s\u1ebd nh\u01b0 r\u1ed3ng tr\u00ean tr\u1eddi t\u1ef1 do v\u1eaby v\u00f9ng kh\u1eafp n\u01a1i, con l\u1edbn l\u00ean s\u1ebd l\u00e0 ng\u01b0\u1eddi n\u0103ng \u0111\u1ed9ng, ho\u1ea1t b\u00e1t & th\u00f4ng minh", "sex": 3}
{"first_name": "L\u01b0u Ph\u01b0\u01a1ng", "meaning": "L\u01b0u c\u00f3 ngh\u0129a l\u00e0 gi\u1eef l\u1ea1i & Ph\u01b0\u01a1ng l\u00e0 m\u00f9i th\u01a1m c\u1ee7a c\u1ecf hoa. D\u1ef1a tr\u00ean 2 \u0111i\u1ec1u \u0111\u00f3, t\u00ean \"L\u01b0u Ph\u01b0\u01a1ng\" mang \u00fd ngh\u0129a con \u0111i \u0111\u1ebfn \u0111\u00e2u c\u0169ng l\u01b0u l\u1ea1i h\u01b0\u01a1ng th\u01a1m thanh m\u00e1t ng\u1ecdt ng\u00e0o c\u1ee7a c\u1ecf hoa", "sex": 7}
{"first_name": "Mai Ph\u01b0\u01a1ng", "meaning": "\"Mai\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p n\u1edf n\u00e0o \u0111\u1ea7u m\u00f9a xu\u00e2n- m\u00f9a tr\u00e0n tr\u1ec1 \u01b0\u1edbc m\u01a1 v\u00e0 hy v\u1ecdng. Ch\u1eef \"Ph\u01b0\u01a1ng\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m. \"Mai Ph\u01b0\u01a1ng\" d\u00f9ng \u0111\u1ec3 n\u00f3i h\u01b0\u01a1ng th\u01a1m c\u1ee7a hoa mai. T\u00ean \"Ph\u01b0\u01a1ng Mai\" g\u1ee3i \u0111\u1ebfn h\u00ecnh \u1ea3nh ng\u01b0\u1eddi con g\u00e1i th\u00f9y m\u1ecb, y\u00eau ki\u1ec1u, xinh \u0111\u1eb9p nh\u01b0 hoa mai.", "sex": 5}
{"first_name": "Minh Ph\u01b0\u01a1ng", "meaning": "th\u01a1m tho, s\u00e1ng s\u1ee7a", "sex": 7}
{"first_name": "M\u1ed9ng Ph\u01b0\u01a1ng", "meaning": "\"M\u1ed9ng\" l\u00e0 m\u01a1 t\u01b0\u1edfng. \"M\u1ed9ng Ph\u01b0\u01a1ng\" ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p nh\u01b0 trong m\u1ed9ng, phong th\u00e1i \u0111oan ch\u00ednh \u0111\u1eb9p \u0111\u1ebd.", "sex": 5}
{"first_name": "Nam Ph\u01b0\u01a1ng", "meaning": "\"Nam Ph\u01b0\u01a1ng\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Ph\u01b0\u01a1ng \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n v\u1ec1 s\u1ef1 s\u00e1ng su\u1ed1t, th\u00f4ng minh, bi\u1ebft \u0111\u1ea1o l\u00fd, c\u00f3 ph\u1ea9m ch\u1ea5t t\u1ed1t", "sex": 7}
{"first_name": "Ng\u00e2n Ph\u01b0\u01a1ng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ng\u00e2n\" ngh\u0129a l\u00e0 b\u1ea1c, ch\u00e2u b\u00e1u ho\u1eb7c v\u1eadt ch\u1ea5t c\u00f3 gi\u00e1 tr\u1ecb, \"Ph\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 th\u01a1m, th\u01a1m th\u1ea3o. T\u00ean \"Ng\u00e2n Ph\u01b0\u01a1ng\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng nh\u00e2n h\u1eadu, hi\u1ec1n l\u00e0nh, \u1ea5m \u00e1p, d\u1ecbu d\u00e0ng, mang \u00fd ngh\u0129a v\u1ec1 cu\u1ed9c s\u1ed1ng \u0111\u1ea7y \u0111\u1ee7 ca\u0309 v\u1ec1 v\u1eadt ch\u1ea5t l\u1eabn v\u1ebb \u0111\u1eb9p c\u1ee7a t\u1ea5m l\u00f2ng th\u01a1m th\u1ea3o.", "sex": 5}
{"first_name": "Nghi Ph\u01b0\u01a1ng", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"Ph\u01b0\u01a1ng\" thu\u1ed9c b\u1ed9 Th\u1ea3o, c\u00f3 ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m, xinh \u0111\u1eb9p. \"Nghi\" thu\u1ed9c b\u1ed9 Nh\u00e2n, c\u00f3 ngh\u0129a l\u00e0 d\u00e1ng v\u1ebb. T\u00ean \"Nghi Ph\u01b0\u01a1ng\" c\u00f3 \u00fd ngh\u0129a l\u00e0 m\u1ed9t con ng\u01b0\u1eddi ch\u00e2n ch\u00ednh, \u0111oan trang, c\u00f3 d\u00e1ng \u0111i\u1ec7u xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, tinh kh\u00f4i t\u1eeb h\u00ecnh th\u1ee9c cho \u0111\u1ebfn t\u00ednh c\u00e1ch.", "sex": 5}
{"first_name": "Ng\u1ecdc Ph\u01b0\u01a1ng", "meaning": "\"Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh,... th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed. \"Ph\u01b0\u01a1ng\" l\u00e0 h\u01b0\u01a1ng th\u01a1m. T\u00ean \"Ng\u1ecdc Ph\u01b0\u01a1ng\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, sang tr\u1ecdng v\u00e0 y\u00eau ki\u1ec1u", "sex": 5}
{"first_name": "Ng\u1eef Ph\u01b0\u01a1ng", "meaning": "\"Ng\u1eef\" l\u00e0 l\u1eddi n\u00f3i. \"Ng\u1eef Ph\u01b0\u01a1ng\" l\u00e0 l\u1eddi n\u00f3i g\u00f3c c\u1ea1nh, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi l\u00fd tr\u00ed, h\u1ecdc th\u1ee9c uy\u00ean th\u00e2m, phong th\u00e1i tao nh\u00e3.", "sex": 3}
{"first_name": "Nguy\u1ec7t Ph\u01b0\u01a1ng", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, nguy\u1ec7t l\u00e0 v\u1ea7ng tr\u0103ng, Tr\u0103ng c\u00f3 v\u1ebb \u0111\u1eb9p v\u00f4 c\u00f9ng b\u00ecnh d\u1ecb, m\u1ed9t v\u1ebb \u0111\u1eb9p kh\u00f4ng c\u1ea7n trang s\u1ee9c, \u0111\u1eb9p m\u1ed9t c\u00e1ch v\u00f4 t\u01b0, h\u1ed3n nhi\u00ean. Tr\u0103ng t\u01b0\u1ee3ng tr\u01b0ng cho v\u1ebb \u0111\u1eb9p h\u1ed3n nhi\u00ean n\u00ean tr\u0103ng ho\u00e0 v\u00e0o thi\u00ean nhi\u00ean, ho\u00e0 v\u00e0o c\u00e2y c\u1ecf. T\u00ean Nguy\u1ec7t Ph\u01b0\u01a1ng g\u1ee3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, gi\u1ea3n d\u1ecb, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean", "sex": 5}
{"first_name": "Nh\u00e3 Ph\u01b0\u01a1ng", "meaning": "Theo ngh\u0129a Ti\u1ebfng vi\u1ec7t, \"Nh\u00e3\" c\u00f3 ngh\u0129a l\u00e0 nh\u1eb9 nh\u00e0ng, l\u1ecbch s\u1ef1, l\u1ecbch thi\u1ec7p,  \"Ph\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m, ti\u1ebfng th\u01a1m. T\u00ean  \"Nh\u00e3 Ph\u01b0\u01a1ng\" d\u00f9ng \u0111\u1ec3 g\u1ee3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i d\u1ecbu d\u00e0ng, h\u00f2a nh\u00e3, nh\u00e3 nh\u1eb7n, trong s\u00e1ng v\u00e0 c\u0169ng r\u1ea5t hi\u1ec3u bi\u1ebft, tinh t\u1ebf.", "sex": 5}
{"first_name": "Nh\u1ea5t Ph\u01b0\u01a1ng", "meaning": "\"Nh\u1ea5t\" l\u00e0 m\u1ed9t. \"Nh\u1ea5t Ph\u01b0\u01a1ng\" l\u00e0 h\u01b0\u1edbng v\u1ec1 m\u1ed9t h\u01b0\u1edbng, ch\u1ec9 con ng\u01b0\u1eddi ki\u00ean \u0111\u1ecbnh m\u1ea1nh m\u1ebd, \u00fd ch\u00ed qu\u1eadt c\u01b0\u1eddng.", "sex": 7}
