{"first_name": "Kim Nh\u00e3", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Nh\u00e3\" l\u00e0 ng\u01b0\u1eddi h\u1ecdc th\u1ee9c uy\u00ean b\u00e1c, ph\u1ea9m h\u1ea1nh \u0111oan ch\u00ednh, n\u00f3i n\u0103ng nho nh\u00e3 nh\u1eb9 nh\u00e0ng .\"Kim\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ti\u1ec1n, l\u00e0 v\u00e0ng. T\u00ean \"Kim\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c cha m\u1eb9 \u0111\u1eb7t v\u1edbi h\u00e0m \u00fd mong mu\u1ed1n cu\u1ed9c s\u1ed1ng sung t\u00fac, ph\u00fa qu\u00fd v\u1eefng b\u1ec1n, ki\u00ean c\u1ed1 d\u00e0nh cho con c\u00e1i.\"Nh\u00e3 Kim\" Mong mu\u1ed1n con c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac an vui cao sang b\u1ec1n v\u01b0ng nh\u01b0ng v\u1eabn th\u1ec3 hi\u1ec7n \u0111\u01b0\u1ee3c t\u00ednh \u0111oan trang nh\u1eb9 nh\u00e0ng nho nh\u00e3", "sex": 5}
{"first_name": "K\u1ef3 Nh\u00e3", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Nh\u00e3\" l\u00e0 ng\u01b0\u1eddi h\u1ecdc th\u1ee9c uy\u00ean b\u00e1c, ph\u1ea9m h\u1ea1nh \u0111oan ch\u00ednh, n\u00f3i n\u0103ng nho nh\u00e3 nh\u1eb9 nh\u00e0ng .\"K\u1ef3\" c\u00f3 th\u1ec3 hi\u1ec3u th\u00e0nh nhi\u1ec1u ngh\u0129a nh\u01b0 l\u00e1 c\u1edd, qu\u00e2n c\u1edd\u2026 tuy nhi\u00ean khi d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean, \"K\u1ef3\" l\u1ea1i mang \u00fd ngh\u0129a r\u1ea5t t\u1ed1t \u0111\u1eb9p.\"Nh\u00e3 K\u1ef3\" N\u00e9t \u0111\u1eb9p d\u1ecbu d\u00e0ng, nh\u00e2n \u00e1i v\u00e0 l\u00e0 ng\u01b0\u1eddi h\u00f2a nh\u00e3, \u0111\u00e1ng y\u00eau", "sex": 5}
