{"first_name": "Thanh Nh\u00e3", "meaning": "T\u00ean \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 trong s\u1ea1ch, li\u00eam khi\u1ebft, ch\u1ec9 \u0111\u1ebfn nh\u00e2n c\u00e1ch cao qu\u00fd c\u1ee7a m\u1ed9t con ng\u01b0\u1eddi \u0111\u00e1ng \u0111\u01b0\u1ee3c t\u00f4n tr\u1ecdng, ng\u01b0\u1ee1ng m\u1ed9. K\u1ebft h\u1ee3p v\u1edbi  \"Nh\u00e3\" ch\u1ec9 s\u1ef1 nh\u00e3 nh\u1eb7n, \u0111\u1eb1m th\u1eafm, \u0111\u1eb9p nh\u01b0ng gi\u1ea3n d\u1ecb, kh\u00f4ng c\u1ea7u k\u1ef3, ph\u00f4 tr\u01b0\u01a1ng. T\u00ean n\u00e0y n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi \u0111\u1eb9p ho\u00e0n h\u1ea3o t\u1eeb t\u00ednh c\u00e1ch \u0111\u1ebfn dung nhan, kh\u00f4ng ai s\u00e1nh b\u1eb1ng", "sex": 5}
{"first_name": "Thi\u00ean Nh\u00e3", "meaning": "\"Nh\u00e3\" l\u00e0 nh\u00e3 nh\u1eb7n, tinh t\u1ebf, l\u1ec5 \u0111\u1ed9, \u0111\u1eb9p gi\u1ea3n d\u1ecb, kh\u00f4ng c\u1ea7u k\u1ef3. \"Thi\u00ean\" l\u00e0 tr\u1eddi, ch\u1ec9 s\u1ef1 bao la, r\u1ed9ng l\u1edbn. T\u00ean \"Thi\u00ean Nh\u00e3 \" mang \u00fd ngh\u0129a con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p, m\u1ed9c m\u1ea1c, \u0111\u00e1ng y\u00eau, khi\u00eam nh\u01b0\u1eddng, t\u1ed1t b\u1ee5ng, t\u1ea5m l\u00f2ng nh\u00e2n t\u1eeb, y\u00eau th\u01b0\u01a1ng m\u1ecdi ng\u01b0\u1eddi", "sex": 5}
{"first_name": "Thi\u1ec7n Nh\u00e3", "meaning": "T\u1ea5m l\u00f2ng con l\u01b0\u01a1ng thi\u1ec7n, hi\u1ec1n h\u00f2a, \u0111\u00f4i m\u00f4i con n\u00f3i l\u1eddi nho nh\u00e3 thanh cao", "sex": 5}
{"first_name": "Thu Nh\u00e3", "meaning": "\"Nh\u00e3\" l\u00e0 nh\u00e3 nh\u1eb7n, tinh t\u1ebf, l\u1ec5 \u0111\u1ed9, \u0111\u1eb9p gi\u1ea3n d\u1ecb, kh\u00f4ng c\u1ea7u k\u1ef3. \"Thu\" l\u00e0 m\u00f9a thu, m\u00f9a m\u00e0 th\u1eddi ti\u1ebft tr\u1edf n\u00ean m\u00e1t d\u1ecbu, kh\u00f4ng kh\u00ed trong l\u00e0nh. T\u00ean \" Thu Nh\u00e3\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi \u00fd ngh\u0129a con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p, m\u1ed9c m\u1ea1c, \u0111\u00e1ng y\u00eau, \u0111\u01b0\u1ee3c y\u00eau th\u01b0\u01a1ng, tr\u00e2n tr\u1ecdng", "sex": 5}
{"first_name": "Th\u01b0 Nh\u00e3", "meaning": "\"Nh\u00e3\" c\u00f3 ngh\u0129a l\u00e0 nh\u00e3 nh\u1eb7n, kh\u00f4ng c\u1ea7u k\u1ef3, ph\u00f4 tr\u01b0\u01a1ng. \"Th\u01b0\" L\u00e0 ng\u01b0\u1eddi con g\u00e1i d\u1ec5 th\u01b0\u01a1ng, xinh \u0111\u1eb9p, \u0111oan trang. T\u00ean \"Th\u01b0 Nh\u00e3 \" mang \u00fd ngh\u0129a s\u1ebd l\u00e0 ng\u01b0\u1eddi h\u1ecdc th\u1ee9c uy\u00ean b\u00e1c, ph\u1ea9m h\u1ea1nh \u0111oan ch\u00ednh, n\u00f3i n\u0103ng nho nh\u00e3, nh\u1eb9 nh\u00e0ng, \u0111\u00e1ng y\u00eau", "sex": 5}
{"first_name": "Th\u00fay Nh\u00e3", "meaning": "\"Nh\u00e3 Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn vi\u00ean ng\u1ecdc \u0111\u1eb9p, tinh t\u1ebf, kh\u00f4ng c\u1ea7u k\u1ef3 l\u00f2e lo\u1eb9t, \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi y\u00eau th\u00edch. T\u00ean \"  Th\u00fay Nh\u00e3\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean kh\u00e1 n\u1eef t\u00ednh d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi xinh \u0111\u1eb9p, qu\u00fd ph\u00e1i, cao sang, nh\u01b0ng r\u1ea5t khi\u00eam nh\u01b0\u1eddng, gi\u1ea3n d\u1ecb ch\u1ee9 kh\u00f4ng ph\u00f4 tr\u01b0\u01a1ng, c\u1ea7u k\u1ef3", "sex": 5}
{"first_name": "Th\u00f9y Nh\u00e3", "meaning": "\"Nh\u00e3\" v\u00e0 \"Th\u00f9y\" \u0111\u1ec1u l\u00e0 nh\u1eefng t\u1eeb t\u00f4n l\u00ean v\u1ebb \u0111\u1eb9p n\u1ed9i t\u00e2m c\u1ee7a ng\u01b0\u1eddi con g\u00e1i, v\u1eeba xinh \u0111\u1eb9p, th\u00f9y m\u1ecb, n\u1ebft na, v\u1eeba gi\u1ea3n d\u1ecb, m\u1ed9c m\u1ea1c, khi\u00eam nh\u01b0\u1eddng, r\u1ea5t \u0111\u00e1ng y\u00eau. V\u00ec v\u1eady t\u00ean \"Th\u00f9y Nh\u00e3 \" l\u00e0 ni\u1ec1m y\u00eau th\u01b0\u01a1ng c\u1ee7a cha m\u1eb9 d\u00e0nh cho con y\u00eau, mong con xinh \u0111\u1eb9p nh\u01b0 ch\u00ednh c\u00e1i t\u00ean c\u1ee7a m\u00ecnh", "sex": 5}
{"first_name": "Tr\u00e2m Nh\u00e3", "meaning": "\"Tr\u00e2m\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfnti\u1ec3u th\u01b0 khu\u00ea c\u00e1c, tr\u00e2m anh, v\u1eeba d\u1ecbu d\u00e0ng, th\u00f4ng minh, l\u1ea1i s\u1eafc s\u1ea3o, sang tr\u1ecdng, qu\u00fd ph\u00e1i. \u0110i k\u00e8m v\u1edbi ch\u1eef \"Nh\u00e3\" n\u00f3i l\u00ean s\u1ef1 nh\u00e3 nh\u1eb7n. T\u00ean \"  Tr\u00e2m Nh\u00e3\" mang \u00fd ngh\u0129a \u0111\u1ed1i v\u1edbi ba m\u1eb9 con l\u00e0 ti\u1ec3u th\u01b0, b\u1ea3o b\u1ed1i, con xinh \u0111\u1eb9p, n\u1ebft na, th\u00f9y m\u1ecb v\u00e0 khi\u00eam nh\u01b0\u1eddng", "sex": 5}
{"first_name": "Tr\u00e2n Nh\u00e3", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Tr\u00e2n\" c\u00f3 ngh\u0129a l\u00e0 b\u00e1u, qu\u00fd, hi\u1ebfm c\u00f3, qu\u00fd tr\u1ecdng, coi tr\u1ecdng. \"Nh\u00e3\" l\u00e0 nh\u00e3 nh\u1eb7n, b\u00ecnh d\u1ecb, kh\u00f4ng ph\u00f4 tr\u01b0\u01a1ng. T\u00ean \"Tr\u00e2n Nh\u00e3 \" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi xinh \u0111\u1eb9p, qu\u00fd ph\u00e1i, nh\u01b0ng kh\u00f4ng v\u00ec th\u1ebf m\u00e0 tr\u1edf n\u00ean ki\u00eau k\u1ef3, m\u00e0 lu\u00f4n hi\u1ec3u bi\u1ebft v\u00e0 khi\u00eam nh\u01b0\u1eddng", "sex": 5}
{"first_name": "Trang Nh\u00e3", "meaning": "\"Nh\u00e3\" l\u00e0 nh\u00e3 nh\u1eb7n, b\u00ecnh d\u1ecb. \"Trang\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa, hoa Trang, c\u00f3 l\u00e1 nh\u01b0 hoa s\u00fang nh\u01b0ng l\u00e1 nh\u1ecf h\u01a1n, hoa b\u00e9 t\u00ed x\u00edu m\u00e0u tr\u1eafng \u0111\u1eb9p l\u1eafm th\u01b0\u1eddng s\u1ed1ng \u1edf h\u1ed3 ao. T\u00ean \"Trang Nh\u00e3 \" g\u1ee3i \u0111\u1ebfn h\u00ecnh \u1ea3nh ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, y\u00eau ki\u1ec1u, d\u1ecbu d\u00e0ng, \u0111\u1eb1m th\u1eafm, m\u1ed9c m\u1ea1c, nh\u01b0ng tr\u00e0n \u0111\u1ea7y s\u1ee9c s\u1ed1ng, b\u1ea3n l\u0129nh, kh\u00f4ng s\u1ee3 kh\u00f3 kh\u0103n, th\u00e1ch th\u1ee9c", "sex": 5}
{"first_name": "Trinh Nh\u00e3", "meaning": "\"Nh\u00e3\" l\u00e0 nh\u00e3 nh\u1eb7n, b\u00ecnh d\u1ecb. \"Trinh\" l\u00e0 ti\u1ebft h\u1ea1nh, g\u1ee3i \u0111\u1ebfn ng\u01b0\u1eddi \u0111\u1ee9c h\u1ea1nh, th\u1ee7y chung. T\u00ean \" Trinh Nh\u00e3 \" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i c\u00f4ng dung ng\u00f4n h\u1ea1nh, hi\u1ec1n l\u00e0nh, d\u1ecbu d\u00e0ng, m\u1ed9c m\u1ea1c, b\u00ecnh d\u1ecb", "sex": 5}
