{"first_name": "Tu\u1ec7 Nh\u00e3", "meaning": "\"Nh\u00e3\" l\u00e0 nh\u00e3 nh\u1eb7n, \u0111\u1eb9p nh\u01b0ng \u0111\u01a1n gi\u1ea3n, kh\u00f4ng c\u1ea7u k\u1ef3, ph\u00f4 tr\u01b0\u01a1ng. \"Tu\u1ec7\" c\u00f3 ngh\u0129a l\u00e0 tr\u00ed th\u00f4ng minh, t\u00e0i tr\u00ed. T\u00ean \"Tu\u1ec7 Nh\u00e3 \" l\u00e0 s\u1ef1 k\u1ebft h\u1ee3p tinh t\u1ebf v\u1ec1 t\u00e0i v\u00e0 s\u1eafc, mang \u00fd ngh\u0129a con v\u1eeba xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau, t\u00ednh c\u00e1ch khi\u00eam nh\u01b0\u1eddng, l\u1ea1i v\u1eeba t\u00e0i n\u0103ng, hi\u1ec3u bi\u1ebft, gi\u1ecfi giang h\u01a1n ng\u01b0\u1eddi", "sex": 5}
