{"first_name": "Qu\u00e2n Nh\u1eadt", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t Nh\u1eadt l\u00e0 m\u1eb7t tr\u1eddi, Qu\u00e2n l\u00e0 vua. Qu\u00e2n Nh\u1eadt l\u00e0 \u00f4ng vua m\u1eb7t tr\u1eddi.\r\nT\u00ean Qu\u00e2n Nh\u1eadt  mang \u00fd ngh\u0129a cha m\u1eb9 mong con sau n\u00e0y s\u1ebd gi\u1ecfi giang, th\u00e0nh \u0111\u1ea1t, t\u1ecfa s\u00e1ng nh\u01b0 m\u1eb7t tr\u1eddi, lu\u00f4n l\u00e0 ni\u1ec1m t\u1ef1 h\u00e0o c\u1ee7a cha m\u1eb9.", "sex": 3}
