{"first_name": "T\u00e2n Nh\u1eadt", "meaning": "T\u00e2n Nh\u1eadt ngh\u0129a l\u00e0 m\u1eb7t tr\u1eddi m\u1edbi ho\u1eb7c 1 ng\u00e0y m\u1edbi \u00fd n\u00f3i cha m\u1eb9 mong cho con c\u00f3 1 t\u01b0\u01a1ng lai t\u1ed1t \u0111\u1eb9p, lu\u00f4n r\u1ea1ng r\u1ee1 t\u01b0\u01a1i s\u00e1ng", "sex": 3}
{"first_name": "T\u1ea5n Nh\u1eadt", "meaning": "T\u1ea5n l\u00e0 ti\u1ebfn t\u1edbi, ph\u00e1t tri\u1ec3n, Nh\u1eadt l\u00e0 m\u1eb7t tr\u1eddi. T\u1ea5n Nh\u1eadt ngh\u0129a l\u00e0 con th\u00f4ng minh, tinh anh nh\u01b0 \u00e1nh s\u00e1ng m\u1eb7t tr\u1eddi & t\u01b0\u01a1ng lai ph\u00e1t tri\u1ec3n kh\u00f4ng ng\u1eebng", "sex": 3}
{"first_name": "Th\u1ecbnh Nh\u1eadt", "meaning": "Th\u1ecbnh mang \u00fd ngh\u0129a h\u01b0ng th\u1ecbnh, sung t\u00fac, Nh\u1eadt mang \u00fd ngh\u0129a con th\u00f4ng minh, gi\u1ecfi giang, s\u00e1ng d\u1ea1. Th\u1ecbnh Nh\u1eadt mang \u00fd ngh\u0129a cha m\u1eb9 mong con c\u00f3 1 cu\u1ed9c s\u1ed1ng gi\u00e0u sang t\u1ed1t \u0111\u1eb9p & t\u00e0i tr\u00ed th\u00f4ng minh", "sex": 3}
