{"first_name": "Tri Nh\u1eadt", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Nh\u1eadt\" c\u00f3 ngh\u0129a l\u00e0 m\u1eb7t tr\u1eddi, th\u00e1i d\u01b0\u01a1ng. \"Tri\" ngo\u00e0i ngh\u0129a l\u00e0 tr\u00ed, t\u1ee9c l\u00e0 c\u00f3 hi\u1ec3u bi\u1ebft, tr\u00ed tu\u1ec7, c\u00f2n d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn  ng\u01b0\u1eddi b\u1ea1n th\u00e2n r\u1ea5t hi\u1ec3u l\u00f2ng m\u00ecnh. T\u00ean \" Tri Nh\u1eadt\" th\u1ec3 hi\u1ec7n mong mu\u1ed1n con th\u00f4ng minh, tr\u00ed tu\u1ec7, th\u00e2n thi\u1ec7n, \u00f4n h\u00f2a, c\u00f3 nhi\u1ec1u b\u1ea1n b\u00e8 qu\u00fd m\u1ebfn", "sex": 3}
{"first_name": "Tri\u1ebft Nh\u1eadt", "meaning": "\"Nh\u1eadt\" theo ngh\u0129a ti\u1ebfng H\u00e1n c\u00f3 ngh\u0129a l\u00e0 m\u1eb7t tr\u1eddi, d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7, th\u00f4ng minh, t\u00e0i tr\u00ed, ngo\u00e0i ra c\u00f2n c\u00f3 ngh\u0129a l\u00e0 ch\u1ee7 nh\u1eadt, th\u1ec3 hi\u1ec7n s\u1ef1 b\u00ecnh y\u00ean, th\u01b0 th\u00e1i. T\u00ean \" Tri\u1ebft Nh\u1eadt\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi c\u00f3 h\u1ecdc th\u1ee9c, l\u00e0 hi\u1ec1n t\u00e0i c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, b\u00ean c\u1ea1nh \u0111\u00f3 lu\u00f4n c\u00f3 phong th\u00e1i \u0111i\u1ec1m \u0111\u1ea1m, b\u00ecnh t\u0129nh trong gi\u1ea3i quy\u1ebft v\u1ea5n \u0111\u1ec1", "sex": 3}
