{"first_name": "Uy\u00ean Ph\u01b0\u01a1ng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Uy\u00ean\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn m\u1ed9t lo\u00e0i chim s\u1ed1ng d\u01b0\u1edbi n\u01b0\u1edbc, tr\u00ean c\u1ed5 c\u00f3 l\u00f4ng m\u00e3 tr\u1eafng v\u00e0 d\u00e0i, c\u00e1nh to v\u00e0 \u0111\u1eb9p, \"Ph\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 ph\u01b0\u01a1ng h\u01b0\u1edbng. T\u00ean \"Uy\u00ean Ph\u01b0\u01a1ng\" n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, n\u1ebft na, d\u00e1ng \u0111i th\u01b0\u1edbt tha, uy\u1ec3n chuy\u1ec3n, c\u00f3 \u00fd ch\u00ed, c\u00f3 b\u1ea3n l\u0129nh, lu\u00f4n vui t\u01b0\u01a1i, tr\u00e0n \u0111\u1ea7y s\u1ee9c s\u1ed1ng.", "sex": 5}
