{"first_name": "Xu\u00e2n Ph\u01b0\u01a1ng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Xu\u00e2n\" c\u00f3 ngh\u0129a l\u00e0 m\u00f9a xu\u00e2n, m\u00f9a kh\u1edfi \u0111\u1ea7u trong n\u0103m m\u1edbi, th\u1eddi ti\u1ebft \u1ea5m \u00e1p, d\u1ec5 ch\u1ecbu. \"Ph\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m, ti\u1ebfng th\u01a1m. \"Xu\u00e2n Ph\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m c\u1ee7a m\u00f9a xu\u00e2n. \"Xu\u00e2n Ph\u01b0\u01a1ng\"  th\u01b0\u1eddng \u0111\u01b0\u1ee3c c\u00e1c cha m\u1eb9 ch\u1ecdn l\u1ef1a \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i v\u1edbi mong \u01b0\u1edbc con s\u1ebd lu\u00f4n xinh \u0111\u1eb9p, \u0111\u1ea7y s\u1ee9c s\u1ed1ng nh\u01b0 m\u00f9a xu\u00e2n.", "sex": 5}
{"first_name": "Y Ph\u01b0\u01a1ng", "meaning": "\"Y\" l\u00e0 qu\u1ea7n \u00e1o. \"Y Ph\u01b0\u01a1ng\" l\u00e0 c\u1ecf m\u1ecdc t\u1ed1t t\u01b0\u01a1i nh\u01b0 qu\u1ea7n \u00e1o quanh m\u00ecnh, ch\u1ec9 v\u00e0o ng\u01b0\u1eddi c\u00f3 cu\u1ed9c s\u1ed1ng may m\u1eafn h\u1ea1nh ph\u00fac.", "sex": 5}
{"first_name": "\u00dd Ph\u01b0\u01a1ng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\u00dd\" c\u00f3 ngh\u0129a l\u00e0 t\u1ed1t l\u00e0nh, t\u1ed1t \u0111\u1eb9p, \"Ph\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m c\u1ee7a c\u1ecf hoa. T\u00ean \"\u00dd Ph\u01b0\u01a1ng\" nh\u1eb1m n\u00f3i \u0111\u1ebfn c\u00f4 g\u00e1i xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, lu\u00f4n g\u1eb7p nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p, may m\u1eafn trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
