{"first_name": "Y\u1ebfn Ph\u01b0\u01a1ng", "meaning": "Theo t\u1eeb \u0111i\u1ec3n c\u00e1c lo\u00e0i v\u1eadt, \"Y\u1ebfn Ph\u01b0\u01a1ng\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn lo\u00e0i chim \u00e9n, m\u1ed9t lo\u00e0i chim bay r\u1ea5t gi\u1ecfi, c\u00f3 kh\u1ea3 n\u0103ng th\u00edch nghi v\u1edbi m\u00f4i tr\u01b0\u1eddng s\u1ed1ng t\u1ed1t. T\u00ean \"Y\u1ebfn Ph\u01b0\u01a1ng\" l\u00e0 c\u00e1i t\u00ean th\u1ec3 hi\u1ec7n mong mu\u1ed1n c\u1ee7a cha m\u1eb9 mong con v\u1eeba xinh \u0111\u1eb9p, th\u00f9y m\u1ecb, v\u1eeba c\u00f3 b\u1ea3n l\u0129nh, c\u00f3 kh\u1ea3 n\u0103ng t\u1ef1 l\u1eadp, \u0111\u1ec3 t\u1ef1 do l\u00e0m \u0111\u01b0\u1ee3c nh\u1eefng \u0111i\u1ec1u m\u00e0 con mu\u1ed1n.", "sex": 5}
