{"first_name": "B\u1ea3o Nh\u01b0", "meaning": "\"Nh\u01b0\": t\u01b0\u01a1ng t\u1ef1, gi\u1ed1ng nh\u01b0, c\u00f3 \u00fd so s\u00e1nh. Ch\u1eef B\u1ea3o theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. Nh\u01b0 Ba\u0309o co\u0301 th\u00ea\u0309 du\u0300ng \u0111\u00ea\u0309 \u0111\u0103\u0323t t\u00ean cho ca\u0309 be\u0301 trai l\u00e2\u0303n ga\u0301i nh\u0103\u0300m vi\u0301 von con nh\u01b0 ho\u0300n qu\u00f4\u0301c ba\u0309o ch\u00e2u ba\u0301u ma\u0300 b\u00f4\u0301 me\u0323 lu\u00f4n n\u00e2ng niu, gi\u01b0\u0303 gi\u0300n", "sex": 5}
