{"first_name": "M\u1ea1nh C\u01b0\u1eddng", "meaning": "M\u1ea1nh trong t\u1eeb \u0111i\u1ec3n Vi\u00ea\u0323t, \u0111\u01b0\u1ee3c d\u1ecbch l\u00e0 kh\u1ecfe kho\u1eafn, m\u1ea1nh m\u1ebd, t\u1eeb ch\u1ec9 v\u1ec1 v\u00f3c d\u00e1ng & s\u1ee9c l\u1ef1c c\u1ee7a con ng\u01b0\u1eddi. Ch\u1eef \"C\u01b0\u1eddng\" theo ti\u1ebfng H\u00e1n Vi\u00ea\u0323t l\u00e0 l\u1ef1c l\u01b0\u1ee1ng, uy l\u1ef1c, v\u1edbi ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i v\u1ec1 th\u1ec3 ch\u1ea5t, m\u1ea1nh kh\u1ecfe tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. K\u1ebft h\u1ee3p 2 t\u00ean n\u00e0y \u0111\u1ec3 \u0111\u1eb7t cho con c\u00f3 ngh\u0129a cha m\u1eb9 mong con tr\u1edf th\u00e0nh ng\u01b0\u1eddi kh\u1ecfe m\u1ea1nh, s\u1ee9c kh\u1ecfe t\u1ed1t, \u00edt b\u1ec7nh t\u1eadt, s\u1ed1ng m\u1ea1nh m\u1ebd, ki\u00ean c\u01b0\u1eddng.", "sex": 3}
