{"first_name": "Minh C\u01b0\u1eddng", "meaning": "\"Minh\" b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, ch\u1eef \"C\u01b0\u1eddng\" theo ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 l\u1ef1c l\u01b0\u1ee1ng, uy l\u1ef1c v\u1edbi ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i v\u1ec1 th\u1ec3 ch\u1ea5t, m\u1ea1nh kh\u1ecfe tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. Ch\u1ecdn cho con t\u00ean \"Minh C\u01b0\u1eddng\", b\u1ed1 m\u1eb9 mong mu\u1ed1n con \u0111\u01b0\u1ee3c v\u0103n v\u00f5 song to\u00e0n, v\u1eeba th\u00f4ng minh l\u1ea1i v\u1eeba kh\u1ecfe m\u1ea1nh.", "sex": 3}
{"first_name": "Nam C\u01b0\u1eddng", "meaning": "V\u1edbi t\u00ean g\u1ecdi \"Nam C\u01b0\u1eddng\", con s\u1ebd nh\u01b0 ngu\u1ed3n sinh kh\u00ed v\u00e0 s\u1ee9c m\u1ea1nh c\u1ee7a v\u00f9ng tr\u1eddi ph\u01b0\u01a1ng Nam lu\u00f4n ph\u00e1t huy \u0111\u01b0\u1ee3c h\u1ebft kh\u1ea3 n\u0103ng v\u00e0 s\u1ee9c m\u1ea1nh c\u1ee7a b\u1ea3n th\u00e2n, v\u00ec th\u1ebf s\u1ebd \u0111\u1ea1t \u0111\u01b0\u1ee3c s\u1ef1 huy ho\u00e0ng v\u00e0 h\u01b0ng th\u1ecbnh. B\u00ean c\u1ea1nh nh\u1eefng may m\u1eafn do tr\u1eddi \u0111\u1ea5t ban t\u1eb7ng, c\u1ed9ng v\u1edbi ch\u00ed kh\u00ed c\u1ee9ng c\u1ecfi, kh\u00f4ng d\u1ec5 b\u1ecb khu\u1ea5t ph\u1ee5c s\u1ebd gi\u00fap con \u0111\u1ea1t \u0111\u01b0\u1ee3c nhi\u1ec1u th\u00e0nh c\u00f4ng trong cu\u1ed9c \u0111\u1eddi.", "sex": 3}
{"first_name": "Ng\u1ecdc C\u01b0\u1eddng", "meaning": "\"Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, c\u00f3 \u0111\u1ed9 tinh khi\u1ebft, s\u00e1ng trong l\u1ea5p l\u00e1nh th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c v\u1edbi \u00fd ngh\u0129a t\u01b0\u1ee3ng tr\u01b0ng cho nh\u1eefng g\u00ec qu\u00fd b\u00e1u, \u0111\u00e1ng \u0111\u1ec3 tr\u00e2n tr\u1ecdng, n\u00e2ng niu. Ch\u1eef \"C\u01b0\u1eddng\" theo ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 l\u1ef1c l\u01b0\u1ee1ng, uy l\u1ef1c v\u1edbi ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i v\u1ec1 th\u1ec3 ch\u1ea5t, m\u1ea1nh kh\u1ecfe tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. Ch\u1ecdn t\u00ean \"Ng\u1ecdc C\u01b0\u1eddng\" \u0111\u1ec3 \u0111\u1eb7t cho con, b\u1ed1 m\u1eb9 ng\u1ee5 \u00fd mong mu\u1ed1n con lu\u00f4n kh\u1ecfe m\u1ea1nh, c\u01b0\u1eddng tr\u00e1ng. S\u1ee9c kh\u1ecfe c\u1ee7a con l\u00e0 \u0111i\u1ec1u m\u00e0 b\u1ed1 m\u1eb9 quan t\u00e2m v\u00e0 l\u1ea5y l\u00e0m \u0111i\u1ec1u qu\u00fd gi\u00e1 nh\u1ea5t.", "sex": 3}
{"first_name": "Phi C\u01b0\u1eddng", "meaning": "Ch\u1eef \"Phi\" theo ngh\u0129a H\u00e1n - Vi\u00ea\u0323t c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u01b0 bay - di chuy\u1ec3n v\u1edbi t\u1ed1c \u0111\u1ed9 cao. Ch\u1eef \"C\u01b0\u1eddng\" theo ti\u1ebfng H\u00e1n Vi\u00ea\u0323t l\u00e0 l\u1ef1c l\u01b0\u1ee1ng, uy l\u1ef1c, v\u1edbi ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i v\u1ec1 th\u1ec3 ch\u1ea5t, m\u1ea1nh kh\u1ecfe tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. T\u00ean \"Phi C\u01b0\u1eddng\" l\u00e0 \u0111i\u1ec1u m\u00e0 b\u1ed1 m\u1eb9 mong mu\u1ed1n: con kh\u00f4ng ch\u1ec9 l\u00e0 ng\u01b0\u1eddi m\u1ea1nh m\u1ebd v\u1ec1 th\u1ec3 tr\u1ea1ng m\u00e0 c\u00f2n th\u00f4ng minh, nhanh nh\u1eb9n, l\u00e0m \u0111\u01b0\u1ee3c nhi\u1ec1u \u0111i\u1ec1u phi th\u01b0\u1eddng v\u00e0 v\u01b0\u01a1n t\u1edbi nh\u1eefng t\u1ea7m cao.", "sex": 3}
