{"first_name": "Th\u1ebf C\u01b0\u1eddng", "meaning": "\"Th\u1ebf\" t\u01b0\u1ee3ng tr\u01b0ng cho v\u1ecb th\u1ebf, t\u01b0 th\u1ebf hi\u00ean ngang lu\u00f4n s\u1eb5n s\u00e0ng \u0111\u00f3n nh\u1eadn nh\u1eefng th\u00e1ch th\u1ee9c c\u1ee7a cu\u1ed9c \u0111\u1eddi. Ch\u1eef \"C\u01b0\u1eddng\" theo ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 l\u1ef1c l\u01b0\u1ee1ng, uy l\u1ef1c v\u1edbi ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i v\u1ec1 th\u1ec3 ch\u1ea5t, m\u1ea1nh kh\u1ecfe tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. Ch\u1ecdn t\u00ean \"Th\u1ebf C\u01b0\u1eddng\" cho con, b\u1ed1 m\u1eb9 mong mu\u1ed1n con trai m\u00ecnh lu\u00f4n c\u1ee9ng c\u1ecfi, kh\u00ed ph\u00e1ch ng\u1eddi ng\u1eddi \u0111\u1ec3 \u0111\u00f3n \u0111\u1ea7u nh\u1eefng th\u1eed th\u00e1ch c\u1ee7a cu\u1ed9c \u0111\u1eddi.", "sex": 3}
{"first_name": "Thi\u00ean C\u01b0\u1eddng", "meaning": "\u0110\u00e2y l\u00e0 t\u00ean g\u1ee3i s\u1ef1 cao qu\u00ed, t\u1ed1t l\u00e0nh \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho c\u00e1c b\u00e9 trai \u1edf v\u1edbi t\u1eeb \"Thi\u00ean\" c\u00f3 ngh\u0129a l\u00e0 ngh\u00ecn, hay ngh\u0129a kh\u00e1c l\u00e0 tr\u1eddi. \"C\u01b0\u1eddng\" c\u00f3 ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i v\u1ec1 th\u1ec3 ch\u1ea5t, m\u1ea1nh kh\u1ecfe tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. T\u00ean \"Thi\u00ean C\u01b0\u1eddng\" c\u00f3 \u00fd mu\u1ed1n con s\u1ebd \u0111\u01b0\u1ee3c tr\u1eddi cao ph\u00f9 h\u1ed9 lu\u00f4n m\u1ea1nh kh\u1ecfe, c\u1ee9ng c\u1ecfi .", "sex": 3}
