{"first_name": "B\u00edch Hu\u1ec7", "meaning": "La\u0300 m\u00f4\u0323t t\u00ean hay th\u01b0\u01a1\u0300ng du\u0300ng \u0111\u0103\u0323t cho con ga\u0301i v\u01a1\u0301i \u201cHu\u1ec7\u201d ngoa\u0300i t\u00ean cu\u0309a m\u00f4\u0323t loa\u0300i hoa \u0111\u0103\u0323c bi\u00ea\u0323t, n\u01a1\u0309 v\u00ea\u0300 \u0111\u00eam, co\u0301 kha\u0309 n\u0103ng to\u0309a h\u01b0\u01a1ng v\u00ea\u0300 ban \u0111\u00eam v\u01a1\u0301i mu\u0300i h\u01b0\u01a1ng nga\u0300o nga\u0323t co\u0300n l\u00e0 tr\u00ed tu\u1ec7, \u00fd ch\u1ec9 th\u00f4ng minh, s\u00e1ng su\u1ed1t, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u00f2ng th\u01b0\u01a1ng, l\u00f2ng nh\u00e2n \u00e1i. Ch\u1eef \"B\u00edch\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t lo\u00e0i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, d\u00f9ng \u0111\u1ec3 ch\u1ec9 con ng\u01b0\u1eddi v\u1edbi mong mu\u1ed1n m\u1ed9t dung m\u1ea1o xinh \u0111\u1eb9p, s\u00e1ng ng\u1eddi, m\u1ed9t ph\u1ea9m ch\u1ea5t cao qu\u00fd, thanh tao.", "sex": 5}
{"first_name": "B\u00ecnh Hu\u1ec7", "meaning": "\u201cHu\u1ec7\u201d l\u00e0 tr\u00ed tu\u1ec7, \u00fd ch\u1ec9 th\u00f4ng minh s\u00e1ng su\u1ed1t, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u00f2ng th\u01b0\u01a1ng, l\u00f2ng nh\u00e2n \u00e1i. \"B\u00ecnh\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 c\u00f4ng b\u1eb1ng, ngang nhau kh\u00f4ng thi\u00ean l\u1ec7ch, c\u00f4ng ch\u00ednh. T\u00ean Hu\u1ec7 Bi\u0300nh th\u01b0\u01a1\u0300ng \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i v\u1edbi \u00fd ngh\u0129a cha m\u1eb9 mong con xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng v\u00e0 \u0111oan trang nh\u01b0 \u0111\u00f3a hoa hu\u1ec7 cao quy\u0301", "sex": 5}
{"first_name": "L\u00e2m Hu\u1ec7", "meaning": "\"Hu\u1ec7\" ch\u1ec9 m\u1ed9t lo\u00e0i hoa, mang m\u00f9i h\u01b0\u01a1ng d\u1ecbu nh\u1eb9. Hu\u1ec7 L\u00e2m n\u00f3i l\u00ean m\u1ed9t ng\u01b0\u1eddi lu\u00f4n bi\u1ebft l\u1eafng nghe, c\u1ea3m nh\u1eadn s\u00e2u s\u1eafc, y\u00eau c\u00e1i \u0111\u1eb9p", "sex": 5}
{"first_name": "Lan Hu\u1ec7", "meaning": "Lan l\u00e0 hoa lan thanh cao, xinh \u0111\u1eb9p. Hu\u1ec7 l\u00e0 lo\u00e0i hoa bi\u1ec3u tr\u01b0ng cho s\u1ef1 thanh khi\u1ebft. Hu\u1ec7 Lan c\u00f3 ngh\u0129a cha m\u1eb9 mong con xinh \u0111\u1eb9p, thanh cao, thu\u1ea7n khi\u1ebft", "sex": 5}
