{"first_name": "\u00c1i H\u1ed3ng", "meaning": "\" B\u00edch H\u1ed3ng\" l\u00e0 m\u1ed9t vi\u00ean ng\u1ecdc s\u00e1ng, t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ee9c kh\u1ecfe, h\u1ea1nh ph\u00fac, may m\u1eafn, s\u1ef1 quy\u1ebft \u0111o\u00e1n , lu\u00f4n chi\u1ebfu s\u00e1ng v\u00e0 gi\u00fap \u0111\u1ee1 ng\u01b0\u1eddi kh\u00e1c. Khi ch\u1ecdn t\u00ean hay cho con l\u00e0 \"H\u1ed3ng B\u00edch\", ngo\u00e0i hi v\u1ecdng con c\u00f3 n\u00e9t \u0111\u1eb9p nh\u00e3 nh\u1eb7n, \u0111\u1eb1m th\u1eafm, m\u1eb7n m\u00e0, b\u1ed1 m\u1eb9 c\u00f2n ng\u1ee5 \u00fd r\u1eb1ng con s\u1ebd d\u00f9ng t\u00ecnh c\u1ea3m c\u1ee7a t\u1ea5m l\u00f2ng trong s\u00e1ng v\u00e0 kh\u1ea3 n\u0103ng c\u1ee7a m\u00ecnh chi\u1ebfu r\u1ecdi \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi k\u00e9m h\u01a1n trong l\u0129nh v\u1ef1c c\u1ee7a m\u00ecnh, \u0111\u1ec3 h\u1ecd c\u0169ng \u0111\u01b0\u1ee3c kh\u1ea3 n\u0103ng nh\u01b0 con, \u0111\u1ec3 h\u1ecd c\u0169ng c\u00f3 \u0111\u01b0\u1ee3c s\u1ef1 b\u00ecnh y\u00ean v\u00e0 th\u1ecbnh v\u01b0\u1ee3ng nh\u01b0 con, l\u00e0m cho h\u1ecd ti\u1ebfn b\u1ed9 h\u01a1n.", "sex": 5}
