{"first_name": "Anh H\u01b0\u01a1ng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"H\u01b0\u01a1ng\"th\u01b0\u1eddng \u0111\u01b0\u1ee3c ch\u1ecdn \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho con g\u00e1i v\u1edbi \u00fd ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m, th\u1ec3 hi\u1ec7n \u0111\u01b0\u1ee3c s\u1ef1 d\u1ecbu d\u00e0ng, quy\u1ebfn r\u0169, v\u00e0 \u0111\u1eb1m th\u1eafm c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. Ch\u1eef Anh theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 \u201cng\u01b0\u1eddi t\u00e0i gi\u1ecfi\u201d v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. B\u00f4\u0301 me\u0323 \u0111\u0103\u0323t t\u00ean \" Anh H\u01b0\u01a1ng\" cho con m\u1edbi mong mu\u1ed1n con m\u00ecnh sau n\u00e0y s\u1ebd c\u00f3 cu\u1ed9c s\u1ed1ng \u00eam \u0111e\u0323p, thanh cao.", "sex": 5}
