{"first_name": "Chi Th\u00f4ng", "meaning": "Chi Th\u00f4ng c\u00f3 ngh\u0129a l\u00e0 c\u00e2y th\u00f4ng. T\u00ean \"Chi Th\u00f4ng\" th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7 tinh th\u00f4ng, \u0111\u01b0\u1eddng \u0111\u1eddi su\u00f4ng s\u1ebb, kh\u00f4ng c\u00f3 kh\u00f3 kh\u0103n, tr\u1edf ng\u1ea1i, c\u00f3 t\u1ea5m l\u00f2ng nh\u00e2n h\u1eadu, bao dung, cu\u1ed9c s\u1ed1ng vui v\u1ebb, chan h\u00f2a", "sex": 3}
{"first_name": "\u0110\u0103ng Th\u00f4ng", "meaning": "\u0110\u0103ng trong ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ng\u1ecdn \u0111\u00e8n. T\u00ean \u0110\u0103ng Th\u00f4ng mang \u00fd ngh\u0129a l\u00e0 s\u1ef1 soi s\u00e1ng & tinh anh, ch\u1ec9 ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7, t\u1ea5m l\u00f2ng nh\u00e2n h\u1eadu, cu\u1ed9c s\u1ed1ng \u00eam \u0111\u1ec1m", "sex": 3}
{"first_name": "\u0110\u1ea1t Th\u00f4ng", "meaning": "\u0110\u1ea1t trong ti\u1ebfng h\u00e1n vi\u1ec7t th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 v\u1ec1 s\u1ef1 th\u00e0nh c\u00f4ng, v\u1ecb th\u1ebf cao sang & tr\u00ed tu\u1ec7 th\u00f4ng su\u1ed1t, th\u1ea5u t\u00ecnh \u0111\u1ea1t l\u00fd c\u1ee7a con ng\u01b0\u1eddi. T\u00ean \u0110\u1ea1t Th\u00f4ng mang \u00fd ngh\u0129a con s\u1ebd l\u00e0 ng\u01b0\u1eddi tr\u00ed tu\u1ec7, c\u00f3 hi\u1ebfu bi\u1ebft & th\u00e0nh c\u00f4ng, \u0111\u1ed7 \u0111\u1ea1t trong s\u1ef1 nghi\u1ec7p", "sex": 3}
{"first_name": "\u0110\u1ee9c Th\u00f4ng", "meaning": "Thep ngh\u0129a H\u00e1n - Vi\u1ec7t, \u0110\u1ee9c t\u1ee9c l\u00e0 ph\u1ea9m h\u1ea1nh, t\u00e1c phong t\u1ed1t \u0111\u1eb9p, quy ph\u1ea1m m\u00e0 con ng\u01b0\u1eddi ph\u1ea3i tu\u00e2n theo, ch\u1ec9 chung nh\u1eefng vi\u1ec7c t\u1ed1t l\u00e0nh l\u1ea5y \u0111\u1ea1o \u0111\u1ec3 l\u1eadp th\u00e2n. T\u00ean \"\u0110\u1ee9c Th\u00f4ng\" h\u00e0m \u00fd ch\u1ec9 ng\u01b0\u1eddi c\u00f3 nh\u00e2n ph\u1ea9m t\u1ed1t, hi\u1ec1n l\u00e0nh, t\u1ed1t b\u1ee5ng, c\u00f3 tr\u00e1i tim \u1ea5m \u00e1p, cu\u1ed9c \u0111\u1eddi thu\u1eadn l\u1ee3i, g\u1eb7p nhi\u1ec1u may m\u1eafn", "sex": 3}
{"first_name": "Duy Th\u00f4ng", "meaning": "Duy trong ti\u1ebfng h\u00e1n vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u01b0 duy, suy ngh\u0129 th\u1ea5u \u0111\u00e1o. Ng\u01b0\u1eddi t\u00ean Duy Th\u00f4ng th\u01b0\u1eddng bi\u1ebft b\u00ecnh t\u0129nh gi\u1ea3i quy\u1ebft v\u1ea5n \u0111\u1ec1 kh\u00f4ng b\u1ed9p ch\u1ed9p h\u00e0nh x\u1eed, c\u00f3 tr\u00ed tu\u1ec7, th\u00f4ng minh & tinh t\u01b0\u1eddng", "sex": 3}
{"first_name": "H\u1ea3i Th\u00f4ng", "meaning": "Theo ngh\u0129a H\u00e1n, \"H\u1ea3i\" c\u00f3 ngh\u0129a l\u00e0 bi\u1ec3n, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la, th\u01b0\u1eddng g\u1ee3i h\u00ecnh \u1ea3nh m\u00eanh m\u00f4ng c\u1ee7a bi\u1ec3n c\u1ea3, m\u1ed9t c\u1ea3nh thi\u00ean nhi\u00ean kh\u00e1 quen thu\u1ed9c v\u1edbi cu\u1ed9c s\u1ed1ng con ng\u01b0\u1eddi. T\u00ean \"H\u1ea3i Th\u00f4ng\" th\u1ec3 hi\u1ec7n s\u1ef1 kho\u00e1ng \u0111\u1ea1t, t\u1ef1 do, t\u1ea5m l\u00f2ng r\u1ed9ng m\u1edf nh\u01b0 h\u00ecnh \u1ea3nh c\u1ee7a thi\u00ean nhi\u00ean h\u00f9ng v\u0129", "sex": 3}
{"first_name": "Ho\u00e0ng Th\u00f4ng", "meaning": "\"Ho\u00e0ng\" trong ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 m\u00e0u v\u00e0ng, \u00e1nh s\u1eafc c\u1ee7a v\u00e0ng v\u00e0 \u1edf m\u1ed9t ngh\u0129a kh\u00e1c th\u00ec \"Ho\u00e0ng\" th\u1ec3 hi\u1ec7n s\u1ef1 nghi\u00eam trang, r\u1ef1c r\u1ee1, huy ho\u00e0ng nh\u01b0 b\u1eadc vua ch\u00faa. T\u00ean \"Ho\u00e0ng Th\u00f4ng\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi v\u0129 \u0111\u1ea1i, c\u00f3 c\u1ed1t c\u00e1ch v\u01b0\u01a1ng gi\u1ea3, v\u1edbi mong mu\u1ed1n t\u01b0\u01a1ng lai ph\u00fa qu\u00fd, sang gi\u00e0u, c\u00f3 tr\u00e1i tim \u1ea5m \u00e1p, nh\u00e2n h\u1eadu, lu\u00f4n vui v\u1ebb, h\u1ed3n nhi\u00ean", "sex": 3}
{"first_name": "Minh Th\u00f4ng", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, Minh c\u00f2n c\u00f3 ngh\u0129a ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (b\u00ecnh minh) th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. T\u00ean \"Minh Th\u00f4ng\" h\u00e0m \u00fd ch\u1ec9 ng\u01b0\u1eddi th\u00f4ng minh, hi\u1ec3u bi\u1ebft, c\u00f3 t\u1ea5m l\u00f2ng nh\u00e2n nh\u00e2n h\u1ec7u, cu\u1ed9c s\u1ed1ng \u1ea5m \u00eam, h\u1ea1nh ph\u00fac", "sex": 3}
{"first_name": "Quang Th\u00f4ng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Th\u00f4ng\" l\u00e0 s\u1ef1 hi\u1ec3u bi\u1ebft, th\u00f4ng su\u1ed1t, am t\u01b0\u1eddng, \"Quang\" l\u00e0 \u00e1nh s\u00e1ng. \"Quang Th\u00f4ng\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c g\u1eedi g\u1eafm v\u1edbi \u00fd ngh\u0129a m\u1ed9t cu\u1ed9c s\u1ed1ng t\u01b0\u01a1i s\u00e1ng c\u1ee7a m\u1ed9t con ng\u01b0\u1eddi hi\u1ec3u bi\u1ebft, th\u00f4ng minh", "sex": 3}
{"first_name": "\u0110\u00ecnh Th\u00f4i", "meaning": "\"\u0110\u00ecnh\" l\u00e0 n\u01a1i quan vi\u00ean l\u00e0m vi\u1ec7c. \"\u0110\u00ecnh Th\u00f4i\" h\u00e0m ngh\u0129a ng\u01b0\u1eddi th\u00fac \u0111\u1ea9y vi\u1ec7c quan tr\u01b0\u1eddng, ch\u1ec9 v\u00e0o ng\u01b0\u1eddi c\u00f3 t\u00e0i n\u0103ng.", "sex": 3}
{"first_name": "An Hy", "meaning": "An l\u00e0 b\u00ecnh y\u00ean. An Hy l\u00e0 chi\u1ebfu s\u00e1ng r\u00f5 r\u00e0ng, ch\u1ec9 con ng\u01b0\u1eddi c\u00f3 \u0111\u1ea1o \u0111\u1ee9c nghi\u00eam minh", "sex": 3}
