{"first_name": "An Th\u1ecbnh", "meaning": "T\u00ean An theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 m\u1ed9t c\u00e1i t\u00ean nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3.  \"Th\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ea7y, nhi\u1ec1u, h\u01b0ng v\u01b0\u1ee3ng, ph\u1ed3n vinh, phong ph\u00fa. \u0110\u1eb7t con t\u00ean \"An Th\u1ecbnh\" l\u00e0 mong mu\u1ed1n con c\u00f3 \u0111\u1ee7 t\u00e0i n\u0103ng, cu\u1ed9c s\u1ed1ng sung t\u00fac, gi\u00e0u sang, \u1ea5m no, h\u1ea1nh ph\u00fac va\u0300 bi\u0300nh an, tr\u00e1nh m\u1ecdi tai \u01b0\u01a1ng hi\u1ec3m h\u1ecda v\u00e0 lu\u00f4n c\u00f3 s\u1ef1 t\u0129nh l\u1eb7ng c\u1ea7n thi\u1ebft.", "sex": 3}
{"first_name": "B\u00e1 Th\u1ecbnh", "meaning": "Trong quan ni\u00ea\u0323m truy\u00ea\u0300n th\u00f4\u0301ng cu\u0309a ng\u01b0\u01a1\u0300i ph\u01b0\u01a1ng \u0110\u00f4ng, con trai \u0111\u01b0\u01a1\u0323c xem la\u0300 ng\u01b0\u01a1\u0300i n\u00f4\u0301i do\u0303i t\u00f4ng \u0111\u01b0\u01a1\u0300ng, k\u00ea\u0301 tu\u0323c nh\u01b0\u0303ng \u01b0\u01a1\u0301c m\u01a1 ch\u01b0a tro\u0300n cu\u0309a cha me\u0323. Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Th\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ea7y, nhi\u1ec1u, h\u01b0ng v\u01b0\u1ee3ng, ph\u1ed3n vinh, phong ph\u00fa.  \u0110\u0103\u0323t t\u00ean \"Ba\u0301 Thi\u0323nh\" cho con, l\u00e0 mong mu\u1ed1n con c\u00f3 \u0111\u1ee7 t\u00e0i n\u0103ng, cu\u1ed9c s\u1ed1ng sung t\u00fac v\u01b0\u01a1ng gia\u0309, gi\u00e0u sang, \u1ea5m no, h\u1ea1nh ph\u00fac", "sex": 3}
{"first_name": "B\u1ea3o Th\u1ecbnh", "meaning": "Ch\u1eef B\u1ea3o theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. \"Th\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ea7y, nhi\u1ec1u, h\u01b0ng v\u01b0\u1ee3ng, ph\u1ed3n vinh, phong ph\u00fa.  \u0110\u1eb7t con t\u00ean \"Ba\u0309o Th\u1ecbnh\" l\u00e0 mong mu\u1ed1n con c\u00f3 \u0111\u1ee7 t\u00e0i n\u0103ng, cu\u1ed9c s\u1ed1ng sung t\u00fac, gi\u00e0u sang, \u1ea5m no, h\u1ea1nh ph\u00fac.", "sex": 3}
{"first_name": "C\u01b0\u1eddng Th\u1ecbnh", "meaning": "\"Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\"C\u01b0\u1eddng\"\" c\u00f3 ngh\u0129a l\u00e0 ki\u00ean c\u01b0\u1eddng, c\u1ee9ng r\u1eafn, m\u1ea1nh kh\u1ecfe, c\u00f3 s\u1ee9c l\u1ef1c. \"\"Th\u1ecbnh\"\" c\u00f3 ngh\u0129a l\u00e0 th\u1ecbnh v\u01b0\u1ee3ng, h\u01b0ng th\u1ecbnh, r\u1ef1c r\u1ee1.\r\n\u0110\u1eb7t t\u00ean \"\"C\u01b0\u1eddng Th\u1ecbnh\"\"  th\u01b0\u1eddng v\u1edbi \u01b0\u1edbc mong ng\u01b0\u1eddi con trai l\u1edbn l\u00ean s\u1ebd m\u1ea1nh m\u1ebd, ki\u00ean c\u01b0\u1eddng, c\u00f3 ch\u00ed h\u01b0\u1edbng v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac, \u1ea5m no.\"", "sex": 3}
{"first_name": "\u0110\u1ee9c Th\u1ecbnh", "meaning": "\"Th\u1ecbnh\" l\u00e0 nhi\u1ec1u th\u00eam. \"\u0110\u1ee9c Th\u1ecbnh\" \u00fd ch\u1ec9 con ng\u01b0\u1eddi c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac v\u00e0 \u0111\u1ea1o \u0111\u1ee9c trong s\u1ea1ch.", "sex": 3}
{"first_name": "Gia Th\u1ecbnh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Gia\" c\u00f3 ngh\u0129a l\u00e0 nh\u00e0, gia \u0111\u00ecnh, d\u00f2ng t\u1ed9c, \"Th\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 l\u00e0 h\u01b0ng th\u1ecbnh, th\u1ecbnh v\u01b0\u1ee3ng; l\u00e0 c\u00f3 nhi\u1ec1u t\u00e0i l\u1ed9c, nh\u00e0 c\u1eeda sung t\u00fac, ng\u00e0y c\u00e0ng \u0103n l\u00ean l\u00e0m ra, c\u00f3 nhi\u1ec1u c\u1ee7a c\u1ea3i... T\u00ean \"Gia Th\u1ecbnh\" l\u00e0 mong mu\u1ed1n t\u01b0\u01a1ng lai b\u00e9 s\u1ebd l\u00e0m cho gia \u0111\u00ecnh, d\u00f2ng t\u1ed9c ng\u00e0y c\u00e0ng th\u1ecbnh v\u01b0\u1ee3ng, gi\u00e0u c\u00f3.", "sex": 3}
{"first_name": "Kh\u01b0\u01a1ng Th\u1ecbnh", "meaning": "\"Kh\u01b0\u01a1ng\" mang \u00fd ngh\u0129a ch\u1ec9 s\u1ef1 y\u00ean \u1ed5n, an b\u00ecnh ho\u1eb7c \u0111\u01b0\u1ee3c d\u00f9ng khi n\u00f3i \u0111\u1ebfn s\u1ef1 gi\u00e0u c\u00f3, \u0111\u1ee7 \u0111\u1ea7y, th\u01b0\u1eddng mang h\u00e0m \u00fd t\u1ed1t \u0111\u1eb9p. \"T\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 s\u1ea1ch s\u1ebd, thanh khi\u1ebft, b\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u1ed9ng l\u1eaby, xinh \u0111\u1eb9p, y\u00ean t\u0129nh. T\u00ean \"Kh\u01b0\u01a1ng T\u1ecbnh\" ch\u1ec9 ng\u01b0\u1eddi kh\u1ecfe m\u1ea1nh, ph\u00fa qu\u00fd  v\u00e0 c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh an.", "sex": 3}
{"first_name": "Nam Th\u1ecbnh", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Th\u1ecbnh \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng th\u1ecbnh v\u01b0\u1ee3ng, vinh hoa, ph\u00fa qu\u00fd", "sex": 3}
{"first_name": "Ng\u1ecdc Th\u1ecbnh", "meaning": "\"Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh,... th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed. \"Th\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ea7y, nhi\u1ec1u, h\u01b0ng v\u01b0\u1ee3ng, ph\u1ed3n vinh, phong ph\u00fa. \u0110\u1eb7t con t\u00ean \"Ng\u1ecdc Th\u1ecbnh\" l\u00e0 mong mu\u1ed1n con c\u00f3 \u0111\u1ee7 t\u00e0i n\u0103ng, cu\u1ed9c s\u1ed1ng sung t\u00fac, gi\u00e0u sang, \u1ea5m no, h\u1ea1nh ph\u00fac", "sex": 7}
{"first_name": "Nh\u1eadt Th\u1ecbnh", "meaning": "\"Th\u1ecbnh\" mang \u00fd ngh\u0129a h\u01b0ng th\u1ecbnh, sung t\u00fac, \"Nh\u1eadt\" h\u00e0m \u00fd ch\u1ec9 s\u1ef1 th\u00f4ng minh, gi\u1ecfi giang, s\u00e1ng d\u1ea1. \"Nh\u1eadt Th\u1ecbnh\"  mang \u00fd ngh\u0129a cha m\u1eb9 mong con c\u00f3 m\u1ed9t cu\u1ed9c s\u1ed1ng gi\u00e0u sang t\u1ed1t \u0111\u1eb9p, t\u00e0i tr\u00ed th\u00f4ng minh.", "sex": 3}
{"first_name": "Ph\u00fac Th\u1ecbnh", "meaning": "\"Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\"Ph\u00fac\"\" c\u00f3 ngh\u0129a l\u00e0 ph\u00fac \u0111\u1ee9c, \u0111i\u1ec1u may m\u1eafn, t\u1ed1t \u0111\u1eb9p, an l\u00e0nh trong cu\u1ed9c s\u1ed1ng, \"\"Th\u1ecbnh\"\" c\u00f3 ngh\u0129a l\u00e0 th\u1ecbnh v\u01b0\u1ee3ng, t\u1ee9c l\u00e0 ng\u00e0y c\u00e0ng \u0111i l\u00ean, ph\u00e1t tri\u1ec3n m\u1ea1nh m\u1ebd. \"\"Ph\u00fac Th\u1ecbnh\"\" c\u00f3 ngh\u0129a l\u00e0 Ph\u00fac \u0111\u1ee9c ng\u00e0y c\u00e0ng nhi\u1ec1u.\r\nT\u00ean \"\"Ph\u00fac Th\u1ecbnh\"\" mang \u00fd ngh\u0129a mong cho ph\u1ee9c \u0111\u1ee9c c\u1ee7a gia \u0111\u00ecnh v\u00e0 d\u00f2ng h\u1ecd s\u1ebd ng\u00e0y c\u00e0ng t\u1ed1t \u0111\u1eb9p.\"", "sex": 3}
{"first_name": "S\u00e2m Th\u1ecbnh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Th\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ea7y, nhi\u1ec1u, h\u01b0ng v\u01b0\u1ee3ng, ph\u1ed3n vinh, phong ph\u00fa.  \"S\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ed3 qu\u00fd b\u00e1u, tr\u00e2n b\u1ea3o, ngo\u00e0i ra c\u00f2n l\u00e0 t\u00ean c\u1ee7a m\u1ed9t lo\u1ea1i c\u1ecf s\u00e2m, l\u00e1 nh\u01b0 c\u00e1i b\u00e0n tay, hoa nh\u1ecf m\u00e0 tr\u1eafng, d\u00f9ng l\u00e0m thu\u1ed1c. T\u00ean \"S\u00e2m Th\u1ecbnh\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u00e0i n\u0103ng, c\u00f3 m\u1ed9t cu\u1ed9c s\u1ed1ng b\u00ecnh an, vinh hoa, ph\u00fa qu\u00fd.", "sex": 3}
{"first_name": "Uy Th\u1ecbnh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Th\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ea7y, nhi\u1ec1u, h\u01b0ng v\u01b0\u1ee3ng, ph\u1ed3n vinh, phong ph\u00fa. \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd. \u0110\u1eb7t con t\u00ean \"Uy Th\u1ecbnh\" l\u00e0 mong mu\u1ed1n con c\u00f3 \u0111\u1ee7 t\u00e0i n\u0103ng, cu\u1ed9c s\u1ed1ng sung t\u00fac, gi\u00e0u sang, \u1ea5m no, h\u1ea1nh ph\u00fac.", "sex": 3}
{"first_name": "Ng\u1ecdc Th\u1eed", "meaning": "\"Ng\u1ecdc\" l\u00e0 \u0111\u00e1 qu\u00fd. \"Ng\u1ecdc Th\u1eed\" l\u00e0 c\u00e2n nh\u1eafc s\u1eafc ng\u1ecdc, h\u00e0m ngh\u0129a con ng\u01b0\u1eddi tri th\u1ee9c, li\u1ec7u \u0111\u1ecbnh c\u00e2n nh\u1eafc tr\u01b0\u1edbc sau r\u00f5 r\u00e0ng.", "sex": 5}
