{"first_name": "Di\u1ec7p Th\u01b0", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t,\"Di\u1ec7p\" ch\u00ednh l\u00e0 \"l\u00e1\" trong Kim Chi Ng\u1ecdc Di\u1ec7p, ng\u1ee5  \u00fd mu\u1ed1n n\u00f3i con nh\u00e0 quy\u1ec1n qu\u00fd sang gi\u00e0u, d\u00f2ng d\u00f5i danh gi\u00e1. \"Th\u01b0\" ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i d\u1ec5 th\u01b0\u01a1ng, xinh \u0111\u1eb9p, \u0111oan trang, c\u00f3 t\u00e2m h\u1ed3n trong s\u00e1ng, r\u1ea5t bao dung v\u00e0 nh\u00e2n h\u1eadu. T\u00ean \"Di\u1ec7p Th\u01b0\" \u0111\u1eb7t v\u1edbi \u00fd ngh\u0129a mong mu\u1ed1n con lu\u00f4n d\u1ec5 th\u01b0\u01a1ng , xinh \u0111\u1eb9p \u0111oan trang hi\u1ec1n h\u1eadu nh\u01b0ng kh\u00f4ng k\u00e9m ph\u1ea7n ki\u00eau sa qu\u00fd ph\u00e1i.", "sex": 5}
{"first_name": "Duy\u00ean Th\u01b0", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Th\u01b0\" ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i d\u1ec5 th\u01b0\u01a1ng, xinh \u0111\u1eb9p, \u0111oan trang, c\u00f3 t\u00e2m h\u1ed3n trong s\u00e1ng, r\u1ea5t bao dung v\u00e0 nh\u00e2n h\u1eadu,\"Duy\u00ean\" ngh\u0129a l\u00e0 s\u1ef1 h\u00e0i ho\u00e0 c\u1ee7a m\u1ed9t s\u1ed1 n\u00e9t t\u1ebf nh\u1ecb \u0111\u00e1ng y\u00eau t\u1ea1o n\u00ean v\u1ebb h\u1ea5p d\u1eabn t\u1ef1 nhi\u00ean c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \u0110\u1eb7t t\u00ean con l\u00e0 \"Duy\u00ean Th\u01b0\" th\u1ec3 hi\u1ec7n mong mu\u1ed1n con s\u1ebd xinh \u0111\u1eb9p ,d\u1ec5 th\u01b0\u01a1ng \u0111oan trang th\u00f9y m\u1ecb c\u00f3 t\u00e2m h\u1ed3n trong s\u00e1ng bao dung nh\u00e2n h\u1eadu.", "sex": 5}
{"first_name": "H\u1ea1nh Th\u01b0", "meaning": "Theo H\u00e1n - Vi\u1ec7t, \"H\u1ea1nh\" th\u1ee9 nh\u1ea5t, c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 ph\u00fac l\u1ed9c, l\u00e0 ph\u01b0\u1edbc l\u00e0nh. Ngh\u0129a th\u1ee9 hai l\u00e0 n\u00f3i v\u1ec1 m\u1eb7t \u0111\u1ea1o \u0111\u1ee9c, t\u00ednh n\u1ebft c\u1ee7a con ng\u01b0\u1eddi. T\u00ean \"H\u1ea1nh Th\u01b0\" ch\u1ec9 ng\u01b0\u1eddi xinh \u0111\u1eb9p, \u0111oan trang, n\u1ebft na, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, bao dung, ph\u1ea9m ch\u1ea5t cao \u0111\u1eb9p.", "sex": 5}
