{"first_name": "Nam Th\u01b0", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Th\u01b0 \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con c\u00f3 hi\u1ec3u bi\u1ebft, t\u00e2m h\u1ed3n trong s\u00e1ng, t\u1ea5m l\u00f2ng bao dung, nh\u00e2n h\u1eadu", "sex": 5}
{"first_name": "Nh\u00e3 Th\u01b0", "meaning": "\"Nh\u00e3\" c\u00f3 ngh\u0129a l\u00e0 nh\u00e3 nh\u1eb7n, kh\u00f4ng c\u1ea7u k\u1ef3, ph\u00f4 tr\u01b0\u01a1ng. \"Th\u01b0\" L\u00e0 ng\u01b0\u1eddi con g\u00e1i d\u1ec5 th\u01b0\u01a1ng, xinh \u0111\u1eb9p, \u0111oan trang. T\u00ean \"Nh\u00e3 Th\u01b0\" mang \u00fd ngh\u0129a s\u1ebd l\u00e0 ng\u01b0\u1eddi h\u1ecdc th\u1ee9c uy\u00ean b\u00e1c, ph\u1ea9m h\u1ea1nh \u0111oan ch\u00ednh, n\u00f3i n\u0103ng nho nh\u00e3, nh\u1eb9 nh\u00e0ng, \u0111\u00e1ng y\u00eau", "sex": 5}
