{"first_name": "Xuy\u1ebfn Th\u01b0", "meaning": "\"Th\u01b0\" l\u00e0 \u00e1m ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i d\u1ec5 th\u01b0\u01a1ng, xinh \u0111\u1eb9p, \u0111oan trang, c\u00f3 t\u00e2m h\u1ed3n trong s\u00e1ng, r\u1ea5t bao dung v\u00e0 nh\u00e2n h\u1eadu. \"Xuy\u1ebfn\" trong ti\u1ebfng H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 v\u00f2ng trang s\u1ee9c b\u1eb1ng v\u00e0ng, th\u1ec3 hi\u1ec7n s\u1ef1 qu\u00fd gi\u00e1, cao sang, tinh x\u1ea3o, \u0111\u1eb9p \u0111\u1ebd. \u0110\u1eb7t t\u00ean con \"Xuy\u1ebfn Th\u01b0\" ngh\u0129a l\u00e0 mong con s\u1ebd xinh \u0111\u1eb9p \u0111oan trang, \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi y\u00eau m\u1ebfn, tr\u00e2n tr\u1ecdng, qu\u00fd gi\u00e1.", "sex": 5}
{"first_name": "Y\u1ebfn Th\u01b0", "meaning": "\"Th\u01b0\" l\u00e0 tin b\u00e1o. \"Y\u1ebfn Th\u01b0\" l\u00e0 lo\u00e0i chim nh\u1ecf b\u00e1o tin l\u00e0nh, ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i xinh x\u1eafn duy\u00ean d\u00e1ng, linh \u0111\u1ed9ng \u0111\u00e1ng y\u00eau.", "sex": 5}
{"first_name": "\u0110\u1ee9c Th\u1ed1ng", "meaning": "\"\u0110\u1ee9c\" l\u00e0 \u0111\u1ea1o \u0111\u1ee9c. \"\u0110\u1ee9c Th\u1ed1ng\" l\u00e0 \u0111\u1ea1o \u0111\u1ee9c \u0111\u01b0\u1ee3c ti\u1ebfp n\u1ed1i kh\u00f4ng ng\u1eebng, ch\u1ec9 con ng\u01b0\u1eddi c\u00f3 nh\u00e2n c\u00e1ch \u0111\u1ea1o \u0111\u1ee9c.", "sex": 3}
