{"first_name": "Quang Th\u1ee9", "meaning": "\"Quang\" l\u00e0 \u00e1nh s\u00e1ng. \"Quang Th\u1ee9\" ngh\u0129a l\u00e0 \u0111\u1ed9 l\u01b0\u1ee3ng khoan dung, ch\u1ec9 con ng\u01b0\u1eddi nh\u00e2n c\u00e1ch cao qu\u00fd, c\u1edfi m\u1edf.", "sex": 3}
