{"first_name": "An Thu\u1eadn", "meaning": "\"An\" theo ngh\u0129a H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 nh\u1eb9 nh\u00e0ng, an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. \"Thu\u1eadn\" l\u00e0 ho\u00e0 thu\u1eadn, hi\u1ebfu thu\u1eadn, ... \u00fd mu\u1ed1n n\u00f3i t\u1edbi nh\u1eefng \u0111i\u1ec1u di\u1ec5n ra su\u00f4n s\u1ebb, thu\u1eadn l\u1ee3i, theo \u00fd mu\u1ed1n c\u1ee7a m\u00ecnh\u2026 \u0110i k\u00e8m ch\u1eef An ph\u00eda tr\u01b0\u1edbc g\u1ee3i l\u00ean \u00fd ngh\u0129a \"mong con s\u1ebd lu\u00f4n g\u1eb7p \u0111\u01b0\u1ee3c nhi\u1ec1u may m\u1eafn, thu\u1eadn l\u1ee3i trong cu\u1ed9c s\u1ed1ng.", "sex": 3}
{"first_name": "B\u00ecnh Thu\u1eadn", "meaning": "\"B\u00ecnh\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 c\u00f4ng b\u1eb1ng, ngang nhau kh\u00f4ng thi\u00ean l\u1ec7ch, c\u00f4ng ch\u00ednh, \"Thu\u1eadn\" c\u00f3 ngh\u0129a l\u00e0 noi theo, hay l\u00e0m theo \u0111\u00fang quy lu\u1eadt, l\u00e0 h\u00f2a thu\u1eadn, hi\u1ebfu thu\u1eadn. V\u00ec v\u1eady, t\u00ean \"B\u00ecnh Thu\u1eadn\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 c\u1ed1t c\u00e1ch, bi\u1ebft ph\u00e2n \u0111\u1ecbnh r\u1ea1ch r\u00f2i, t\u00ednh kh\u00ed \u00f4n h\u00f2a, bi\u1ebft \u0111i\u1ec1u ph\u1ed1i c\u00f4ng vi\u1ec7c, th\u00e1i \u0111\u1ed9 tr\u01b0\u1edbc cu\u1ed9c s\u1ed1ng lu\u00f4n b\u00ecnh t\u0129nh an \u0111\u1ecbnh. Ngo\u00e0i ra, \"B\u00ecnh Thu\u1eadn\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 \u00eam th\u1ea5m, c\u1ea3m gi\u00e1c th\u01b0 th\u00e1i hay ch\u1ec9 v\u1ec1 h\u00f2a kh\u00ed, v\u1eadn h\u1ea1n.", "sex": 3}
{"first_name": "Ch\u00ednh Thu\u1eadn", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thu\u1eadn\" c\u00f3 ngh\u0129a l\u00e0 noi theo, hay l\u00e0m theo \u0111\u00fang quy lu\u1eadt, l\u00e0 h\u00f2a thu\u1eadn, hi\u1ebfu thu\u1eadn. K\u1ebft h\u1ee3p v\u1edbi, \"Ch\u00ednh\" \u00fd ch\u1ec9 h\u1ee3p v\u1edbi quy ph\u1ea1m, \u0111\u00fang theo ph\u00e9p t\u1eafc. \"Ch\u00ednh Thu\u1eadn\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho con h\u00e0m \u00fd con l\u00e0 ng\u01b0\u1eddi ngay th\u1eb3ng, khu\u00f4n ph\u00e9p, l\u00f2ng d\u1ea1 th\u1eb3ng ngay, kh\u00f4ng m\u01b0u \u0111\u1ed3 m\u1edd \u00e1m.", "sex": 3}
{"first_name": "\u0110\u1ee9c Thu\u1eadn", "meaning": "\"Thu\u1eadn\" l\u00e0 chi\u1ec1u theo. \"\u0110\u1ee9c Thu\u1eadn\" l\u00e0 l\u00e0m theo \u0111\u1ea1o \u0111\u1ee9c.", "sex": 3}
{"first_name": "Duy Thu\u1eadn", "meaning": "Duy trong ti\u1ebfng h\u00e1n vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u01b0 duy, suy ngh\u0129 th\u1ea5u \u0111\u00e1o, \"Thu\u1eadn\" c\u00f3 ngh\u0129a l\u00e0 noi theo, hay l\u00e0m theo \u0111\u00fang quy lu\u1eadt, l\u00e0 h\u00f2a thu\u1eadn, hi\u1ebfu thu\u1eadn. T\u00ean \"Duy Thu\u1eadn\" th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi th\u00f4ng minh, c\u00f3 hi\u1ec3u bi\u1ebft, bi\u1ebft v\u00e2ng l\u1eddi, hi\u1ebfu thu\u1eadn, l\u00e0m vi\u1ec7c c\u00f3 ch\u1ee7 ki\u1ebfn, kh\u00f4ng b\u1ed9p ch\u1ed9p, n\u00f4ng n\u1ed7i", "sex": 3}
{"first_name": "Minh Thu\u1eadn", "meaning": "\"Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\"Minh\"\" c\u00f3 ngh\u0129a l\u00e0 s\u00e1ng, th\u00f4ng minh, s\u00e1ng su\u1ed1t, minh m\u1eabn, \"\"Thu\u1eadn\"\" l\u00e0 ho\u00e0 thu\u1eadn, hi\u1ebfu thu\u1eadn, \u00fd mu\u1ed1n n\u00f3i t\u1edbi nh\u1eefng \u0111i\u1ec1u di\u1ec5n ra su\u00f4n s\u1ebb, thu\u1eadn l\u1ee3i theo \u00fd mu\u1ed1n c\u1ee7a m\u00ecnh. \"\"Minh Thu\u1eadn\"\" c\u00f3 th\u1ec3 hi\u1ec3u l\u00e0 th\u00f4ng minh v\u00e0 hi\u1ebfu thu\u1eadn.\r\nT\u00ean \"\"Minh Thu\u1eadn\"\" g\u1ee3i l\u00ean \u00fd ngh\u0129a \"\"mong con s\u1ebd tr\u1edf th\u00e0nh ng\u01b0\u1eddi th\u00f4ng minh, gi\u1ecfi giang v\u00e0 lu\u00f4n g\u1eb7p \u0111\u01b0\u1ee3c nhi\u1ec1u may m\u1eafn, thu\u1eadn l\u1ee3i trong cu\u1ed9c s\u1ed1ng\"\".\"", "sex": 3}
{"first_name": "M\u1ed9c Thu\u1eadn", "meaning": "\"M\u1ed9c\" l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. \"Thu\u1eadn\" c\u00f3 ngh\u0129a l\u00e0 h\u00f2a thu\u1eadn, hi\u1ebfu thu\u1eadn. \"M\u1ed9c Thu\u1eadn\" ngh\u0129a l\u00e0 cha m\u1eb9 mong con c\u00f3 cu\u1ed9c s\u1ed1ng an nh\u00e0n, t\u00e2m t\u00ednh b\u00ecnh d\u1ecb, m\u1ed9c m\u1ea1c, ch\u1ea5t ph\u00e1c, lu\u00f4n \u0111\u01b0\u1ee3c thu\u1eadn bu\u1ed3m xu\u00f4i gi\u00f3.", "sex": 3}
{"first_name": "Nam Thu\u1eadn", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Thu\u1eadn \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con c\u00f3 hi\u1ec3u bi\u1ebft, bi\u1ebft \u0111\u1ea1o ngh\u0129a, hi\u1ebfu thu\u1eadn v\u1edbi cha m\u1eb9. G\u1eb7p nhi\u1ec1u may m\u1eafn, thu\u1eadn b\u01b0\u1eddm xu\u00f4i gi\u00f3", "sex": 3}
{"first_name": "Ph\u01b0\u1edbc Thu\u1eadn", "meaning": "Ch\u1eef \"Thu\u1eadn\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t ngh\u0129a l\u00e0 noi theo, n\u01b0\u01a1ng theo, ch\u1eef \"Ph\u01b0\u1edbc\" ngh\u0129a l\u00e0 may m\u1eafn, g\u1eb7p nhi\u1ec1u \u0111i\u1ec1u t\u1ed1t l\u00e0nh do Tr\u1eddi Ph\u1eadt ban t\u1eb7ng cho ng\u01b0\u1eddi l\u00e0m nhi\u1ec1u vi\u1ec7c nh\u00e2n \u0111\u1ee9c.  T\u00ean \"Ph\u01b0\u1edbc Thu\u1eadn\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 nh\u00e2n c\u00e1ch t\u1ed1t, nh\u00e2n h\u1eadu, hi\u1ec1n l\u00e0nh, bi\u1ebft h\u1ecdc h\u1ecfi v\u00e0 ph\u00e1t huy l\u00e0m nh\u1eefng vi\u1ec7c t\u1ed1t.", "sex": 3}
{"first_name": "Uy\u00ean Thu\u1eadn", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thu\u1eadn\" c\u00f3 ngh\u0129a l\u00e0 noi theo, hay l\u00e0m theo \u0111\u00fang quy lu\u1eadt, l\u00e0 h\u00f2a thu\u1eadn, hi\u1ebfu thu\u1eadn. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i.  T\u00ean \"Uy\u00ean Thu\u1eadn\" l\u00e0 mong con s\u1ebd ngoan ngo\u00e3n, bi\u1ebft v\u00e2ng l\u1eddi, hi\u1ebfu th\u1ea3o v\u1edbi \u00f4ng b\u00e0, cha m\u1eb9, cu\u1ed9c \u0111\u1eddi con s\u1ebd thu\u1eadn bu\u1ed3m xu\u00f4i gi\u00f3, g\u1eb7p nhi\u1ec1u may m\u1eafn.", "sex": 5}
{"first_name": "Duy Thu\u1eadt", "meaning": "\"Duy\" l\u00e0 duy nh\u1ea5t. \"Duy Thu\u1eadt\" c\u00f3 ngh\u0129a  h\u01b0\u1edbng t\u1edbi duy nh\u1ea5t m\u1ed9t gi\u1ea3i ph\u00e1p, ch\u1ec9 con ng\u01b0\u1eddi ki\u00ean \u0111\u1ecbnh nh\u1ea5t qu\u00e1n, t\u00e2m tr\u00ed v\u1eefng v\u00e0ng v\u1edbi m\u1ee5c ti\u00eau \u0111\u1ec1 ra.", "sex": 3}
{"first_name": "B\u00e1 Th\u01b0\u1edbc", "meaning": "\"B\u00e1\" l\u00e0 to l\u1edbn. \"B\u00e1 Th\u01b0\u1edbc\" ch\u1ec9 con ng\u01b0\u1eddi minh m\u1eabn r\u00f5 r\u00e0ng, tr\u00ed tu\u1ec7 s\u00e1ng su\u1ed1t.", "sex": 3}
{"first_name": "C\u1ea3nh Th\u01b0\u1ee3c", "meaning": "\"C\u1ea3nh\" l\u00e0 ph\u00f2ng b\u1ecb. \"C\u1ea3nh Th\u01b0\u1ee3c\" l\u00e0 kh\u00f3a ch\u1eb7t ph\u00f2ng b\u1ecb, \u00fd ch\u1ec9 con ng\u01b0\u1eddi th\u1eadn tr\u1ecdng chu to\u00e0n, nghi\u00eam t\u00fac nh\u1ea5t m\u1ef1c.", "sex": 3}
