{"first_name": "H\u1ea1 Th\u01b0\u01a1ng", "meaning": "Theo c\u00e1ch th\u00f4ng th\u01b0\u1eddng, \"H\u1ea1\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u00f9a h\u00e8, m\u1ed9t trong nh\u1eefng m\u00f9a s\u00f4i n\u1ed5i v\u1edbi nhi\u1ec1u ho\u1ea1t \u0111\u1ed9ng vui v\u1ebb c\u1ee7a n\u0103m. T\u00ean \"H\u1ea1 Th\u01b0\u01a1ng\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 v\u1ebb ngo\u00e0i thu h\u00fat, r\u1ea1ng r\u1ee1 nh\u01b0 m\u00f9a h\u00e8, c\u00f3 t\u00e2m h\u1ed3n trong s\u00e1ng, r\u1ea5t hi\u1ec3u bi\u1ebft, v\u00e0 c\u00f3 t\u1ea5m l\u00f2ng nh\u00e2n \u00e1i, y\u00eau th\u01b0\u01a1ng m\u1ecdi ng\u01b0\u1eddi", "sex": 5}
{"first_name": "Ho\u00e0i Th\u01b0\u01a1ng", "meaning": "\"Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\"Ho\u00e0i\"\" l\u00e0 nh\u1edb, ho\u00e0i ni\u1ec7m, \"\"Th\u01b0\u01a1ng\"\" l\u00e0 th\u01b0\u01a1ng c\u1ea3m, c\u1ea3m nh\u1eadn. T\u00ean \"\"Ho\u00e0i Th\u01b0\u01a1ng\"\" d\u00f9ng \u0111\u1ec3 g\u1ee3i \u0111\u1ebfn h\u00ecnh \u1ea3nh ng\u01b0\u1eddi con g\u00e1i d\u1ecbu d\u00e0ng, \u0111\u1eb1m th\u1eafm, c\u00f3 n\u1ed9i t\u00e2m s\u00e2u s\u1eafc. \r\nT\u00ean \"\"Ho\u00e0i Th\u01b0\u01a1ng\"\" \u00fd mu\u1ed1n g\u1ee3i nh\u1edb ho\u00e0i ni\u1ec7m, v\u1ec1 nh\u1eefng k\u00ed \u1ee9c quan tr\u1ecdng c\u1ee7a b\u1ed1 m\u1eb9.\"", "sex": 5}
{"first_name": "M\u00e2n Th\u01b0\u01a1ng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"M\u00e2n Th\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 b\u1ea7u tr\u1eddi m\u00f9a thu trong xanh, \u00e1nh n\u1eafng \u1ea5m \u00e1p, th\u1eddi ti\u1ebft kh\u00f4ng gay g\u1eaft nh\u01b0 m\u00f9a h\u00e8 v\u00e0 c\u0169ng kh\u00f4ng l\u1ea1nh l\u1ebdo nh\u01b0 m\u00f9a \u0111\u00f4ng, ch\u1ec9 ng\u01b0\u1eddi hi\u1ec1n l\u00e0nh, \u00f4n h\u00f2a, t\u1ed1t b\u1ee5ng v\u00e0 lu\u00f4n c\u00f3 l\u1eadp tr\u01b0\u1eddng v\u00e0 ch\u00ednh ki\u1ebfn b\u1ea3n th\u00e2n.", "sex": 3}
