{"first_name": "Duy Th\u01b0\u1eddng", "meaning": "Duy trong ti\u1ebfng h\u00e1n vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u01b0 duy, suy ngh\u0129 th\u1ea5u \u0111\u00e1o.\"Th\u01b0\u1eddng\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ea1o l\u00ed, quan h\u1ec7 lu\u00e2n l\u00fd, th\u1ec3 hi\u1ec7n m\u1ed9t s\u1ef1 l\u00e2u d\u00e0i, kh\u00f4ng thay \u0111\u1ed5i. Ng\u01b0\u1eddi t\u00ean \"Duy Th\u01b0\u1eddng\" l\u00e0 ng\u01b0\u1eddi bi\u1ebft b\u00ecnh t\u0129nh gi\u1ea3i quy\u1ebft v\u1ea5n \u0111\u1ec1 kh\u00f4ng b\u1ed9p ch\u1ed9p h\u00e0nh x\u1eed, c\u00f3 tr\u00ed tu\u1ec7, th\u00f4ng minh & tinh t\u01b0\u1eddng", "sex": 3}
{"first_name": "H\u1ea3i Th\u01b0\u1eddng", "meaning": "Theo ngh\u0129a H\u00e1n, \"H\u1ea3i\" c\u00f3 ngh\u0129a l\u00e0 bi\u1ec3n, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la, th\u01b0\u1eddng g\u1ee3i h\u00ecnh \u1ea3nh m\u00eanh m\u00f4ng c\u1ee7a bi\u1ec3n c\u1ea3, m\u1ed9t c\u1ea3nh thi\u00ean nhi\u00ean kh\u00e1 quen thu\u1ed9c v\u1edbi cu\u1ed9c s\u1ed1ng con ng\u01b0\u1eddi. \"Th\u01b0\u1eddng\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ea1o l\u00ed, quan h\u1ec7 lu\u00e2n l\u00fd, th\u1ec3 hi\u1ec7n m\u1ed9t s\u1ef1 l\u00e2u d\u00e0i, kh\u00f4ng thay \u0111\u1ed5i.  T\u00ean \"H\u1ea3i Th\u01b0\u1eddng\" th\u1ec3 hi\u1ec7n s\u1ef1 kho\u00e1ng \u0111\u1ea1t, t\u1ef1 do, t\u1ea5m l\u00f2ng r\u1ed9ng m\u1edf nh\u01b0 h\u00ecnh \u1ea3nh c\u1ee7a bi\u1ec3n kh\u01a1i, s\u1ed1ng c\u00f3 \u0111\u1ea1o l\u00fd, c\u00f3 nh\u00e2n ngh\u0129a", "sex": 3}
{"first_name": "Kh\u00e1nh Th\u01b0\u1eddng", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Kh\u00e1nh\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng s\u1ef1 vi\u1ec7c vui m\u1eebng, mang c\u1ea3m gi\u00e1c h\u00e2n hoan, th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 di\u1ec5n t\u1ea3 kh\u00f4ng kh\u00ed trong c\u00e1c bu\u1ed5i ti\u1ec7c, bu\u1ed5i l\u1ec5 \u0103n m\u1eebng. T\u00ean \"Kh\u00e1nh Th\u01b0\u1eddng\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi \u0111\u1ee9c h\u1ea1nh, th\u1ee7y chung, t\u1ed1t \u0111\u1eb9p mang l\u1ea1i c\u1ea3m gi\u00e1c vui t\u01b0\u01a1i, hoan h\u1ec9 cho nh\u1eefng ng\u01b0\u1eddi xung quanh", "sex": 3}
{"first_name": "Long Th\u01b0\u1eddng", "meaning": "Long l\u00e0 r\u1ed3ng, bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a tr\u00ed th\u00f4ng minh & th\u1ecbnh v\u01b0\u1ee3ng. Th\u01b0\u1eddng c\u00f3 ngh\u0129a l\u00e0 l\u00e2u d\u00e0i kh\u00f4ng thay \u0111\u1ed5i. Long Th\u01b0\u1eddng  c\u00f3 ngh\u0129a con s\u1ebd lu\u00f4n th\u00f4ng minh, lanh l\u1ee3i nh\u01b0 lo\u00e0i r\u1ed3ng, s\u1ed1ng th\u1ecbnh v\u01b0\u1ee3ng & uy nghi c\u1ea3 \u0111\u1eddi", "sex": 3}
