{"first_name": "Nghi Th\u01b0\u1eddng", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, \"Nghi\" mang ngh\u0129a l\u00e0 ti\u00eau chu\u1ea9n, ph\u00e9p t\u1eafc, g\u01b0\u01a1ng m\u1eabu.  \"Th\u01b0\u1eddng\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ea1o l\u00ed, quan h\u1ec7 lu\u00e2n l\u00fd, th\u1ec3 hi\u1ec7n m\u1ed9t s\u1ef1 l\u00e2u d\u00e0i, kh\u00f4ng thay \u0111\u1ed5i.V\u00ec v\u1eady t\u00ean \"Nghi Th\u01b0\u1eddng\" l\u00e0 d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi s\u1ed1ng c\u00f3 chu\u1ea9n m\u1ef1c, c\u00f3 ph\u00e9p t\u1eafc, l\u00e0 ng\u01b0\u1eddi \u0111\u00e1ng ng\u01b0\u1ee1ng m\u1ed9", "sex": 3}
