{"first_name": "Xu\u00e2n Th\u01b0\u1eddng", "meaning": "Xu\u00e2n l\u00e0 m\u00f9a chuy\u1ec3n ti\u1ebfp t\u1eeb \u0111\u00f4ng sang h\u1ea1, th\u1eddi ti\u1ebft \u1ea5m \u00e1p, th\u01b0\u1eddng \u0111\u01b0\u1ee3c coi l\u00e0 m\u1edf \u0111\u1ea7u c\u1ee7a n\u0103m, m\u00f9a xu\u00e2n v\u1edbi ti\u1ebft tr\u1eddi se l\u1ea1nh, kh\u00f4ng kh\u00ed trong l\u00e0nh, tr\u0103m hoa \u0111ua n\u1edf. \"Th\u01b0\u1eddng\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ea1o l\u00ed, quan h\u1ec7 lu\u00e2n l\u00fd, th\u1ec3 hi\u1ec7n m\u1ed9t s\u1ef1 l\u00e2u d\u00e0i, kh\u00f4ng thay \u0111\u1ed5i. \u0110\u1eb7t t\u00ean \"Xu\u00e2n Th\u01b0\u1eddng\" cho con l\u00e0 mong con s\u1ebd c\u00f3 cu\u1ed9c s\u1ed1ng vui t\u01b0\u01a1i h\u1ea1nh ph\u00fac l\u00e2u d\u00e0i, kh\u00f4ng bao gi\u1edd k\u1ebft th\u00fac", "sex": 3}
