{"first_name": "Minh Th\u01b0\u1edfng", "meaning": "\"Minh Th\u01b0\u1edfng\" ngh\u0129a l\u00e0 ban khen r\u00f5 r\u00e0ng, h\u00e0m \u00fd con ng\u01b0\u1eddi c\u00f4ng minh ch\u00ednh tr\u1ef1c, h\u00e0nh x\u1eed chu \u0111\u00e1o.", "sex": 3}
{"first_name": "C\u1ea9m Th\u1ee5c", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"Th\u1ee5c\" c\u00f3 ngh\u0129a l\u00e0 th\u00e0nh th\u1ea1o, thu\u1ea7n th\u1ee5c, n\u00f3i v\u1ec1 nh\u1eefng th\u1ee9 \u0111\u00e3 quen thu\u1ed9c, n\u00f3i v\u1ec1 s\u1ef1 tinh t\u01b0\u1eddng, t\u1ec9 m\u1ec9.  \"C\u1ea9m\" c\u00f3 ngh\u0129a l\u00e0 g\u1ea5m v\u00f3c, l\u1ee5a l\u00e0, l\u1ea5p l\u00e1nh, r\u1ef1c r\u1ee1. \"C\u1ea9m Th\u1ee5c\" l\u00e0 t\u00ean g\u1ecdi kh\u00e1 gi\u1ea3n d\u1ecb \u0111\u01b0\u1ee3c \u0111\u1eb7t cho c\u00e1c b\u00e9 g\u00e1i nh\u1eb1m mong \u01b0\u1edbc con c\u00f3 \u0111\u01b0\u1ee3c t\u00ednh ki\u00ean c\u01b0\u1eddng, ch\u0103m ch\u1ec9, tinh t\u1ebf, l\u00e0m g\u00ec c\u0169ng ch\u00fa t\u00e2m ho\u00e0n th\u00e0nh t\u1ed1t.", "sex": 5}
