{"first_name": "Hi\u1ec1n Th\u1ee5c", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, khi n\u00f3i v\u1ec1 ng\u01b0\u1eddi th\u00ec \"Hi\u1ec1n\" c\u00f3 ngh\u0129a l\u00e0 t\u1ed1t l\u00e0nh, c\u00f3 t\u00e0i c\u00f3 \u0111\u1ee9c. \"Th\u1ee5c\" c\u00f3 ngh\u0129a l\u00e0 th\u00e0nh th\u1ea1o, thu\u1ea7n th\u1ee5c, n\u00f3i v\u1ec1 nh\u1eefng th\u1ee9 \u0111\u00e3 quen thu\u1ed9c, n\u00f3i v\u1ec1 s\u1ef1 tinh t\u01b0\u1eddng, t\u1ec9 m\u1ec9. T\u00ean \"Hi\u1ec1n Th\u1ee5c\" ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 t\u00ednh \u00f4n h\u00f2a, \u0111\u1eb1m th\u1eafm, d\u00e1ng v\u1ebb, c\u1eed ch\u1ec9 nh\u1eb9 nh\u00e0ng, th\u00e2n thi\u1ec7n, c\u00f3 t\u00e0i n\u0103ng & \u0111\u1ee9c h\u1ea1nh, c\u1ea7n m\u1eabn, ch\u0103m ch\u1ec9", "sex": 5}
