{"first_name": "Loan Th\u1ee5c", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Loan\" ch\u00ednh l\u00e0 chim Ph\u01b0\u1ee3ng m\u00e1i, m\u1ed9t lo\u00e0i chim th\u1ea7n ti\u00ean linh thi\u00eang trong truy\u1ec1n thuy\u1ebft. \"Th\u1ee5c\" c\u00f3 ngh\u0129a l\u00e0 th\u00e0nh th\u1ea1o, thu\u1ea7n th\u1ee5c, n\u00f3i v\u1ec1 nh\u1eefng th\u1ee9 \u0111\u00e3 quen thu\u1ed9c, n\u00f3i v\u1ec1 s\u1ef1 tinh t\u01b0\u1eddng, t\u1ec9 m\u1ec9. Theo h\u00ecnh \u1ea3nh cao qu\u00fd c\u1ee7a chim Loan, t\u00ean \"Loan Th\u1ee5c\" \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, nh\u00e2n c\u00e1ch thanh cao, ph\u1ea9m ch\u1ea5t v\u01b0\u01a1ng gi\u1ea3 & l\u00e0 ng\u01b0\u1eddi t\u00e0i n\u0103ng, tinh t\u01b0\u1eddng, ch\u0103m ch\u1ec9, c\u1ea7n m\u1eabn, \u0111\u1ee9c h\u1ea1nh, ph\u00fac h\u1eadu.", "sex": 5}
