{"first_name": "\u0110i\u1ec7p Th\u00fay", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn vi\u00ean ng\u1ecdc \u0111\u1eb9p, ng\u1ecdc qu\u00fd, l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd lu\u00f4n xinh \u0111\u1eb9p, quy\u1ec1n qu\u00fd, \u0111\u01b0\u1ee3c tr\u00e2n tr\u1ecdng v\u00e0 n\u00e2ng niu.\"\u0110i\u1ec7p\" c\u00f3 ngh\u0129a l\u00e0 b\u01b0\u1edbm, ch\u1ec9  ng\u01b0\u1eddi xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau, thu h\u00fat, t\u1ea1o c\u1ea3m gi\u00e1c vui t\u01b0\u01a1i, thanh th\u1ea3n.\"\u0110i\u1ec7p Th\u00fay\", ba m\u1eb9  mong mu\u1ed1n con xinh \u0111\u1eb9p \u0111\u00e1ng y\u00eau, thu h\u00fat \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi nh\u01b0 l\u00e0 vi\u00ean ng\u1ecdc qu\u00fd.", "sex": 5}
{"first_name": "Di\u1ec7u Th\u00fay", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn vi\u00ean ng\u1ecdc \u0111\u1eb9p, ng\u1ecdc qu\u00fd.  \"Th\u00fay\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd lu\u00f4n xinh \u0111\u1eb9p, quy\u1ec1n qu\u00fd, \u0111\u01b0\u1ee3c tr\u00e2n tr\u1ecdng v\u00e0 n\u00e2ng niu.\"Di\u1ec7u\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1eb9p, l\u00e0 tuy\u1ec7t di\u1ec7u, \u00fd ch\u1ec9 nh\u1eefng \u0111i\u1ec1u tuy\u1ec7t v\u1eddi \u0111\u01b0\u1ee3c t\u1ea1o n\u00ean b\u1edfi s\u1ef1 kh\u00e9o l\u00e9o, k\u00ec di\u1ec7u.\"Di\u1ec7u Th\u00fay\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con lu\u00f4n l\u00e0 vi\u00ean ng\u1ecdc qu\u00fd xinh \u0111\u1eb9p trong m\u1eaft m\u1ecdi ng\u01b0\u1eddi.", "sex": 5}
{"first_name": "Du Th\u00fay", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn vi\u00ean ng\u1ecdc \u0111\u1eb9p, ng\u1ecdc qu\u00fd.  \"Th\u00fay\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd lu\u00f4n xinh \u0111\u1eb9p, quy\u1ec1n qu\u00fd, \u0111\u01b0\u1ee3c tr\u00e2n tr\u1ecdng v\u00e0 n\u00e2ng niu.\"Du\"ngh\u0129a l\u00e0 hay \u0111i \u0111\u1ed9ng, kh\u00f4ng \u1edf ch\u1ed7 nh\u1ea5t \u0111\u1ecbnh,c\u00f3 th\u1ec3 \u0111i ngao du \u0111\u00e2y \u0111\u00f3, kh\u00e1m ph\u00e1 kh\u1eafp n\u01a1i.\"Du Th\u00fay\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi n\u0103ng \u0111\u1ed9ng, xinh \u0111\u1eb9p, quy\u1ebfn r\u0169 v\u00e0 l\u00e0 vi\u00ean ng\u1ecdc qu\u00fd c\u1ee7a gia \u0111\u00ecnh.", "sex": 5}
{"first_name": "\u0110\u1ee9c Th\u00fay", "meaning": "\"Th\u00fay\" l\u00e0 xanh bi\u1ebfc. \" \u0110\u1ee9c Th\u00fay\" h\u00e0m ngh\u0129a l\u00e0m cho \u0111\u1ea1o \u0111\u1ee9c n\u1ea3y n\u1edf sinh s\u00f4i nh\u01b0 ch\u1ed3i l\u1ed9c bi\u1ebft.", "sex": 5}
