{"first_name": "Duy\u00ean Th\u00fay", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn vi\u00ean ng\u1ecdc \u0111\u1eb9p, ng\u1ecdc qu\u00fd, l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd lu\u00f4n xinh \u0111\u1eb9p, quy\u1ec1n qu\u00fd, \u0111\u01b0\u1ee3c tr\u00e2n tr\u1ecdng v\u00e0 n\u00e2ng niu. \"Duy\u00ean\" ngh\u0129a l\u00e0 s\u1ef1 h\u00e0i ho\u00e0 \u0111\u00e1ng y\u00eau t\u1ea1o n\u00ean v\u1ebb h\u1ea5p d\u1eabn t\u1ef1 nhi\u00ean c\u1ee7a ng\u01b0\u1eddi con g\u00e1i.\"Duy\u00ean Th\u00fay\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p d\u1ecbu d\u00e0ng l\u00e0 vi\u00ean ng\u1ecdc qu\u00fd \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi tr\u00e2n tr\u1ecdng n\u00e2ng niu.", "sex": 5}
{"first_name": "Giang Th\u00fay", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn vi\u00ean ng\u1ecdc \u0111\u1eb9p, ng\u1ecdc qu\u00fd.  \"Th\u00fay\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd lu\u00f4n xinh \u0111\u1eb9p, quy\u1ec1n qu\u00fd, \u0111\u01b0\u1ee3c tr\u00e2n tr\u1ecdng v\u00e0 n\u00e2ng niu.\"Giang\" l\u00e0 d\u00f2ng s\u00f4ng, th\u01b0\u1eddng ch\u1ec9 nh\u1eefng \u0111i\u1ec1u cao c\u1ea3, l\u1edbn lao. Ng\u01b0\u1eddi ta th\u01b0\u1eddng l\u1ea5y t\u00ean \"Giang\" \u0111\u1eb7t t\u00ean v\u00ec th\u01b0\u1eddng th\u00edch nh\u1eefng h\u00ecnh \u1ea3nh con s\u00f4ng v\u1eeba \u00eam \u0111\u1ec1m, v\u1eeba m\u1ea1nh m\u1ebd nh\u01b0 cu\u1ed9c \u0111\u1eddi con ng\u01b0\u1eddi c\u00f3 l\u00fac th\u0103ng, l\u00fac tr\u1ea7m.\"Giang Th\u00fay\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd lu\u00f4n xinh \u0111\u1eb9p , quy\u1ec1n qu\u00fd, v\u00e0 l\u00e0 vi\u00ean ng\u1ecdc \u0111\u1eb9p qu\u00fd gi\u00e1 c\u1ee7a ba m\u1eb9.", "sex": 5}
{"first_name": "Ho\u00e0ng Th\u00fay", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ho\u00e0ng\" l\u00e0 to l\u1edbn, v\u0129 \u0111\u1ea1i, r\u1ef1c r\u1ee1, huy ho\u00e0ng, v\u00e0 nh\u1eefng th\u1ee9 c\u00f3 li\u00ean quan \u0111\u1ebfn vua ch\u00faa, \"Th\u00fay\" th\u01b0\u1eddng l\u00e0 n\u00f3i v\u1ec1 ng\u01b0\u1eddi \u0111\u1eb9p, m\u1ef9 nh\u00e2n. \"Ho\u00e0ng Th\u00fay\" l\u00e0 s\u1ef1 k\u1ebft h\u1ee3p tinh t\u1ebf d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi c\u00f3 th\u00e2n ph\u1eadn cao qu\u00fd, d\u00f2ng d\u00f5i \u0111\u1ebf v\u01b0\u01a1ng. T\u00ean \"Ho\u00e0ng Th\u00fay\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, cao sang, qu\u00fd ph\u00e1i.", "sex": 5}
{"first_name": "H\u1ed3ng Th\u00fay", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"H\u1ed3ng\" ngh\u0129a l\u00e0 m\u00e0u \u0111\u1ecf, \"Th\u00fay\" ngh\u0129a l\u00e0 m\u00e0u xanh, \"H\u1ed3ng\" v\u00e0 \"Th\u00fay\" \u0111\u1ec1u l\u00e0 hai t\u1eeb mang m\u00e0u s\u1eafc t\u01b0\u01a1i s\u00e1ng. T\u00ean \"H\u1ed3ng Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi vui t\u01b0\u01a1i, ho\u1ea1t b\u00e1t, tr\u00e0n \u0111\u1ea7y s\u1ee9c s\u1ed1ng. C\u00e1i t\u00ean \"H\u1ed3ng Th\u00fay\" \u0111\u01b0\u1ee3c g\u1eedi g\u1eafm v\u1edbi \u00fd ngh\u0129a v\u1ec1 cu\u1ed9c s\u1ed1ng t\u01b0\u01a1i \u0111\u1eb9p, vui v\u1ebb cu\u0309a con.", "sex": 5}
{"first_name": "Ki\u1ec1u Th\u00fay", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn vi\u00ean ng\u1ecdc \u0111\u1eb9p, ng\u1ecdc qu\u00fd, l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd lu\u00f4n xinh \u0111\u1eb9p, quy\u1ec1n qu\u00fd, \u0111\u01b0\u1ee3c tr\u00e2n tr\u1ecdng v\u00e0 n\u00e2ng niu. \"Ki\u1ec1u\" mang \u00fd ngh\u0129a l\u00e0 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, c\u00f3 nhan s\u1eafc rung \u0111\u1ed9ng l\u00f2ng ng\u01b0\u1eddi.\"Ki\u1ec1u Th\u00fay\", con l\u00e0 vi\u00ean ng\u1ecdc \u0111\u1eb9p, s\u00e1ng trong, nhanh nh\u1eb9n v\u00e0 s\u00e2u s\u1eafc.", "sex": 5}
{"first_name": "Loan Th\u00fay", "meaning": "Loan l\u00e0 chim ph\u01b0\u1ee3ng m\u00e1i linh thi\u00eang, cao qu\u00fd. Th\u00fay l\u00e0 t\u00ean 1 lo\u00e0i ng\u1ecdc qu\u00fd. Loan Th\u00fay c\u00f3 ngh\u0129a con xinh \u0111\u1eb9p, cao sang, qu\u00fd ph\u00e1i & qu\u00fd gi\u00e1, c\u00f3 t\u00e2m h\u1ed3n trong s\u00e1ng, n\u1ebft na, th\u00f9y m\u1ecb", "sex": 5}
{"first_name": "Mai Th\u00fay", "meaning": "\"Mai\" l\u00e0 t\u00ean lo\u00e0i hoa n\u1edf v\u00e0o m\u00f9a xu\u00e2n, b\u00e1o hi\u1ec7u ni\u1ec1m vui, hy v\u1ecdng. \"Th\u00fay\" l\u00e0 vi\u00ean ng\u1ecdc xanh bi\u1ebfc may m\u1eafn. \"Mai Th\u00fay\" ngh\u0129a l\u00e0 mong con xinh \u0111\u1eb9p, t\u01b0\u01a1i t\u1eafn, vui t\u01b0\u01a1i v\u00e0 lu\u00f4n g\u1eb7p may m\u1eafn.", "sex": 5}
{"first_name": "M\u1eabn Th\u00fay", "meaning": "\"M\u1eabn\" c\u00f3 ngh\u0129a l\u00e0 ch\u0103m ch\u1ec9, c\u1ea7n m\u1eabn si\u00eang n\u0103ng. \"Th\u00fay\" l\u00e0 t\u00ean m\u1ed9t lo\u1ea1i ng\u1ecdc may m\u1eafn, xinh \u0111\u1eb9p. \"M\u1eabn Th\u00fay\" l\u00e0 c\u00e1i t\u00ean th\u01b0\u1eddng d\u00e0nh cho ng\u01b0\u1eddi con g\u00e1i, v\u1edbi mong \u01b0\u1edbc con v\u1eeba xinh \u0111\u1eb9p v\u1eeba hi\u1ec1n ngoan, t\u00ednh t\u00ecnh c\u1ea7n m\u1eabn, ch\u0103m ch\u1ec9, kh\u00f4ng bi\u1ebfng nh\u00e1c, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng.", "sex": 5}
{"first_name": "Minh Th\u00fay", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Minh\" c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, hi\u1ec3u bi\u1ebft, s\u00e1ng su\u1ed1t, \"Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn s\u1ef1 tr\u00e2n tr\u1ecdng, h\u00e2n hoan. T\u00ean \"Minh Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi lanh l\u1ee3i, c\u00f3 tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft, \u0111\u1ee9c h\u1ea1nh, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau qu\u00fd.", "sex": 5}
{"first_name": "My Th\u00fay", "meaning": "\"My\" c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p,  \u0111\u00e1ng y\u00eau. \"Th\u00fay\" l\u00e0 ng\u1ecdc th\u00fay xanh bi\u1ebfc may m\u1eafn, qu\u00fd gi\u00e1. \"My Th\u00fay\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con xinh \u0111\u1eb9p, qu\u00fd gi\u00e1 nh\u01b0 vi\u00ean ng\u1ecdc th\u00fay.", "sex": 5}
{"first_name": "Nga Th\u00fay", "meaning": "\"Nga\" l\u00e0 t\u1eeb hoa m\u1ef9 d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p, th\u01b0\u1edbt tha xinh nh\u01b0 ti\u00ean. \"Th\u00fay\" l\u00e0 t\u00ean lo\u1ea1i ng\u1ecdc qu\u00fd.  \"Nga Th\u00fay\" mang \u00fd ngh\u0129a con xinh \u0111\u1eb9p nh\u01b0 ng\u1ecdc qu\u00fd.", "sex": 5}
{"first_name": "Nghi Th\u00fay", "meaning": "\"Nghi Th\u00fay\", con nh\u01b0 lo\u00e0i chim Th\u00fay \u0111i\u1ec3u cao sang, nh\u01b0 vi\u00ean ng\u1ecdc th\u00fay qu\u00fd gi\u00e1 v\u1edbi d\u00e1ng v\u1ebb oai phong, uy nghi.", "sex": 5}
{"first_name": "Ng\u1ecdc Th\u00fay", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc qu\u00fd gi\u00e1, \"Th\u00fay\" c\u0169ng c\u00f3 ngh\u0129a l\u00e0 vi\u00ean ng\u1ecdc qu\u00fd. T\u00ean \"Ng\u1ecdc Th\u00fay\" d\u00f9ng \u0111\u1ec3 th\u1ec3 hi\u1ec7n s\u1ef1 tr\u00e2n tr\u1ecdng, h\u00e2n hoan khi c\u00f3 s\u1ef1 ra \u0111\u1eddi c\u1ee7a con, con l\u00e0 vi\u00ean ng\u1ecdc qu\u00fd c\u1ee7a cha me, con s\u1ebd lu\u00f4n \u0111\u01b0\u1ee3c n\u00e2ng niu v\u00e0 tr\u00e2n tr\u1ecdng, m\u1ecdi ng\u01b0\u1eddi s\u1ebd lu\u00f4n y\u00eau th\u01b0\u01a1ng, c\u01b0ng chi\u1ec1u con.", "sex": 5}
{"first_name": "Nguy\u1ec7t Th\u00fay", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, nguy\u1ec7t l\u00e0 v\u1ea7ng tr\u0103ng, Tr\u0103ng c\u00f3 v\u1ebb \u0111\u1eb9p v\u00f4 c\u00f9ng b\u00ecnh d\u1ecb, m\u1ed9t v\u1ebb \u0111\u1eb9p kh\u00f4ng c\u1ea7n trang s\u1ee9c, \u0111\u1eb9p m\u1ed9t c\u00e1ch v\u00f4 t\u01b0, h\u1ed3n nhi\u00ean. Tr\u0103ng t\u01b0\u1ee3ng tr\u01b0ng cho v\u1ebb \u0111\u1eb9p h\u1ed3n nhi\u00ean n\u00ean tr\u0103ng ho\u00e0 v\u00e0o thi\u00ean nhi\u00ean, ho\u00e0 v\u00e0o c\u00e2y c\u1ecf. T\u00ean Nguy\u1ec7t Th\u00fay g\u1ee3i \u0111\u1ebfn h\u00ecnh \u1ea3nh ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, quy\u1ec1n qu\u00fd nh\u01b0ng c\u0169ng m\u1ed9c m\u1ea1c, gi\u1ea3n d\u1ecb, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean", "sex": 5}
{"first_name": "Nh\u00e3 Th\u00fay", "meaning": "\"Nh\u00e3 Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn vi\u00ean ng\u1ecdc \u0111\u1eb9p, tinh t\u1ebf, kh\u00f4ng c\u1ea7u k\u1ef3 l\u00f2e lo\u1eb9t, \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi y\u00eau th\u00edch. T\u00ean \"Nh\u00e3 Th\u00fay\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean kh\u00e1 n\u1eef t\u00ednh d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi xinh \u0111\u1eb9p, qu\u00fd ph\u00e1i, cao sang, nh\u01b0ng r\u1ea5t khi\u00eam nh\u01b0\u1eddng, gi\u1ea3n d\u1ecb ch\u1ee9 kh\u00f4ng ph\u00f4 tr\u01b0\u01a1ng, c\u1ea7u k\u1ef3", "sex": 5}
