{"first_name": "Oanh Th\u00fay", "meaning": "\"Th\u00fay\" l\u00e0 trong tr\u1ebbo. \"Oanh Th\u00fay\" ngh\u0129a l\u00e0 chim oanh h\u00f3t ti\u1ebfng trong veo, ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p tuy\u1ec7t v\u1eddi.", "sex": 5}
{"first_name": "Ph\u01b0\u01a1ng Th\u00fay", "meaning": "Theo ngh\u0129a H\u00e1n- Vi\u1ec7t, \"Ph\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m, ti\u1ebfng th\u01a1m, \"Th\u00fay\" d\u00f9ng \u0111\u1ec3 th\u1ec3 hi\u1ec7n s\u1ef1 tr\u00e2n tr\u1ecdng, h\u00e2n hoan. T\u00ean \"Ph\u01b0\u01a1ng Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi xinh \u0111\u1eb9p, duy\u00ean d\u00e1ng, tinh t\u1ebf, \u0111\u01b0\u1ee3c y\u00eau th\u01b0\u01a1ng, qu\u00fd m\u1ebfn.", "sex": 5}
{"first_name": "Ph\u01b0\u1ee3ng Th\u00fay", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Th\u00fay\" l\u00e0 m\u00e0u xanh, \"Ph\u01b0\u1ee3ng\" l\u00e0 m\u1ed9t lo\u00e0i chim qu\u00fd c\u1ee7a ho\u00e0ng gia. T\u00ean \"Ph\u01b0\u1ee3ng Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi quy\u1ec1n qu\u00fd, cao sang, l\u00e0 c\u00e1i t\u00ean m\u00e0 cha m\u1eb9 mong mu\u1ed1n con m\u00ecnh s\u1ebd c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng sung t\u00fac, ph\u00fa qu\u00fd, lu\u00f4n c\u00f3 \u0111\u01b0\u1ee3c ni\u1ec1m vui v\u00e0 h\u1ea1nh ph\u00fac.", "sex": 5}
{"first_name": "Qu\u1ef3nh Th\u00fay", "meaning": "Ch\u1eef \"Th\u00fay\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 m\u00e0u xanh, t\u00ean m\u1ed9t lo\u1ea1i ng\u1ecdc qu\u00fd. \"Qu\u1ef3nh\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p ch\u1ec9 n\u1edf khi tr\u1eddi t\u1ed1i, m\u00e0u tr\u1eafng tinh kh\u00f4i, m\u00f9i h\u01b0\u01a1ng thanh khi\u1ebft, d\u1ecbu d\u00e0ng.\r\nT\u00ean \"Qu\u1ef3nh Th\u00fay\" mang \u00fd ngh\u0129a l\u00e0 con s\u1ebd xinh \u0111\u1eb9p v\u00e0 \u0111\u1ea7y s\u1ee9c s\u1ed1ng nh\u01b0 c\u00e2y qu\u1ef3nh xanh bi\u1ebfc ho\u1eb7c con s\u1ebd xinh \u0111\u1eb9p nh\u01b0 hoa, nh\u01b0 ng\u1ecdc, th\u00edch h\u1ee3p \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 c\u00f3 m\u1ec7nh H\u1ecfa v\u00ec M\u1ed9c (c\u00e2y qu\u1ef3nh) sinh H\u1ecfa.", "sex": 5}
{"first_name": "Sa Th\u00fay", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn vi\u00ean ng\u1ecdc \u0111\u1eb9p, ng\u1ecdc qu\u00fd.  \"Sa Th\u00fay\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd lu\u00f4n xinh \u0111\u1eb9p, quy\u1ec1n qu\u00fd, d\u1ecbu d\u00e0ng, duy\u00ean d\u00e1ng, \u0111\u01b0\u1ee3c tr\u00e2n tr\u1ecdng v\u00e0 n\u00e2ng niu.", "sex": 5}
{"first_name": "Sam Th\u00fay", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn vi\u00ean ng\u1ecdc \u0111\u1eb9p, ng\u1ecdc qu\u00fd. Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Sam\" c\u00f3 ngh\u0129a l\u00e0 s\u1eafc, b\u00e9n, nh\u1ecdn.  Ngo\u00e0i ra \"Sam\" c\u00f2n l\u00e0 t\u00ean m\u1ed9t lo\u00e0i \u0111\u1ed9ng v\u1eadt ch\u00e2n \u0111\u1ed1t \u1edf bi\u1ec3n t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 th\u1ee7y chung, son s\u1eafc, s\u1ed1ng c\u00f3 t\u00ecnh c\u00f3 ngh\u0129a. Ng\u01b0\u1eddi t\u00ean \"Sam Th\u00fay\" th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh, s\u1eafc s\u1ea3o, s\u1ed1ng kh\u00f4n kh\u00e9o, hi\u1ec3u bi\u1ebft, lu\u00f4n xinh \u0111\u1eb9p, quy\u1ec1n qu\u00fd, \u0111\u01b0\u1ee3c tr\u00e2n tr\u1ecdng v\u00e0 n\u00e2ng niu.", "sex": 5}
{"first_name": "Th\u00e1i Th\u00fay", "meaning": "Theo ngh\u0129a ti\u1ebfng Vi\u1ec7t, \"Th\u00e1i\" c\u00f3 ngh\u0129a l\u00e0 th\u1eddi v\u1eadn, ho\u00e0n c\u1ea3nh thu\u1eadn l\u1ee3i, may m\u1eafn. T\u00ean \"Th\u00e1i Th\u00fay\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd lu\u00f4n xinh \u0111\u1eb9p, quy\u1ec1n qu\u00fd, \u0111\u01b0\u1ee3c tr\u00e2n tr\u1ecdng v\u00e0 n\u00e2ng niu, cu\u1ed9c \u0111\u1eddi con s\u1ebd thu\u1eadn l\u1ee3i v\u00e0 g\u1eb7p nhi\u1ec1u may m\u1eafn.", "sex": 5}
