{"first_name": "B\u00edch Th\u1ee5y", "meaning": "Ch\u1eef \"B\u00edch\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t lo\u00e0i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng. \"Th\u1ee5y\" l\u00e0 t\u00ean chung c\u1ee7a ng\u1ecdc khu\u00ea ng\u1ecdc b\u00edch, \u0111\u1eddi x\u01b0a d\u00f9ng ng\u1ecdc \u0111\u1ec3 l\u00e0m tin. C\u1ea3 \"B\u00edch\" v\u00e0 \"Th\u1ee5y\" \u0111\u1ec1u l\u00e0 nh\u1eefng t\u1eeb \u0111\u1ec1u \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 c\u00e1c lo\u1ea1i ng\u1ecdc qu\u00fd. V\u00ec v\u1eady t\u00ean \"B\u00edch Th\u1ee5y\" th\u1ec3 hi\u1ec7n \u0111\u01b0\u1ee3c s\u1ef1 thanh cao, qu\u00fd ph\u00e1i v\u00e0 \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd xinh \u0111\u1eb9p, sang tr\u1ecdng, cu\u1ed9c s\u1ed1ng sung t\u00fac, vinh hoa", "sex": 5}
{"first_name": "Du Th\u1ee5y", "meaning": "\"Du Thu\u1ef5\" l\u00e0 vi\u1ec7c \u0111i l\u00e3ng du trong gi\u1ea5c m\u01a1, \u0111\u1ea1i kh\u00e1i l\u00e0 trong gi\u1ea5c m\u01a1 v\u1ec1 m\u1ed9t cu\u1ed9c \u0111\u1eddi, m\u1ed9t chuy\u1ebfn \u0111i th\u1ef1c th\u1ef1c, \u1ea3o \u1ea3o, kh\u1eafc kho\u1ea3i \u0111\u1ee3i ch\u1edd. \u0110\u1eb7t t\u00ean n\u00e0y cho con, b\u1ed1 m\u1eb9 nh\u01b0 g\u1eedi g\u1eafm ni\u1ec1m th\u01b0\u01a1ng nh\u1edb, t\u00ecm g\u1eb7p v\u00e0o trong m\u01a1.", "sex": 5}
{"first_name": "D\u0169ng Th\u1ee5y", "meaning": "Ch\u1eef D\u0169ng trong t\u1eeb H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ee9c m\u1ea1nh, can \u0111\u1ea3m ng\u01b0\u1eddi c\u00f3 kh\u00ed ph\u00e1ch, ng\u01b0\u1eddi gan d\u1ea1, d\u0169ng kh\u00ed. \"Th\u1ee5y\" l\u00e0 t\u00ean chung c\u1ee7a ng\u1ecdc khu\u00ea ng\u1ecdc b\u00edch, \u0111\u1eddi x\u01b0a d\u00f9ng ng\u1ecdc \u0111\u1ec3 l\u00e0m tin. T\u00ean \"Th\u1ee5y\" th\u1ec3 hi\u1ec7n \u0111\u01b0\u1ee3c s\u1ef1 thanh cao, qu\u00fd ph\u00e1i. T\u00ean \"D\u0169ng Th\u1ee5y\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd xinh \u0111\u1eb9p, sang tr\u1ecdng, cu\u1ed9c s\u1ed1ng sung t\u00fac, vinh hoa, c\u00f3 b\u1ea3n l\u0129nh, kh\u00ed ph\u00e1ch ki\u00ean c\u01b0\u1eddng", "sex": 3}
{"first_name": "D\u01b0\u01a1ng Th\u1ee5y", "meaning": "\"D\u01b0\u01a1ng\" trong Th\u00e1i D\u01b0\u01a1ng hay c\u00f2n g\u1ecdi l\u00e0 m\u1eb7t tr\u1eddi \u00fd ch\u1ec9 lu\u00f4n r\u1ea1ng ng\u1eddi, chi\u1ebfu s\u00e1ng. \"D\u01b0\u01a1ng Th\u1ee5y\" th\u1ec3 hi\u1ec7n phong th\u00e1i v\u1eeba nhu m\u00ec, hi\u1ec1n h\u00f2a, v\u1eeba s\u00f4i n\u1ed5i, tr\u1ebb trung v\u00e0 lu\u00f4n t\u01b0\u01a1i t\u1eafn, mong mu\u1ed1n con lu\u00f4n r\u1ea1ng r\u1ee1 nh\u01b0 \u00e1nh m\u1eb7t tr\u1eddi nh\u01b0ng v\u1eabn d\u1ecbu d\u00e0ng, \u0111\u00e1ng y\u00eau. Cu\u1ed9c s\u1ed1ng sung t\u00fac, b\u00ecnh an", "sex": 7}
