{"first_name": "H\u1ea3i Th\u1ee5y", "meaning": "Theo ngh\u0129a H\u00e1n, \"H\u1ea3i\" c\u00f3 ngh\u0129a l\u00e0 bi\u1ec3n, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la.  \"Th\u1ee5y\" l\u00e0 t\u00ean chung c\u1ee7a ng\u1ecdc khu\u00ea ng\u1ecdc b\u00edch, \u0111\u1eddi x\u01b0a d\u00f9ng ng\u1ecdc \u0111\u1ec3 l\u00e0m tin. T\u00ean \"H\u1ea3i Th\u1ee5y\" th\u1ec3 hi\u1ec7n \u0111\u01b0\u1ee3c s\u1ef1 thanh cao, qu\u00fd ph\u00e1i, bao dung, nh\u00e2n h\u1eadu. T\u00ean \"H\u1ea3i Th\u1ee5y\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd xinh \u0111\u1eb9p, sang tr\u1ecdng, cu\u1ed9c s\u1ed1ng sung t\u00fac, vinh hoa, c\u00f3 t\u1ea5m l\u00f2ng r\u1ed9ng m\u1edf, bao la nh\u01b0 bi\u1ec3n c\u1ea3", "sex": 3}
