{"first_name": "Khu\u00ea Th\u1ee5y", "meaning": "Trong ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Khu\u00ea\" l\u00e0 t\u00ean c\u1ee7a m\u1ed9t v\u00ec sao trong th\u1eadp nh\u1ecb b\u00e1t t\u00fa Sao Khu\u00ea & l\u00e0 t\u00ean c\u1ee7a m\u1ed9t lo\u00e0i ng\u1ecdc. \"Th\u1ee5y\" l\u00e0 t\u00ean chung c\u1ee7a ng\u1ecdc khu\u00ea ng\u1ecdc b\u00edch, \u0111\u1eddi x\u01b0a d\u00f9ng ng\u1ecdc \u0111\u1ec3 l\u00e0m tin. T\u00ean \"Khu\u00ea Th\u1ee5y\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd xinh \u0111\u1eb9p, sang tr\u1ecdng, cu\u1ed9c s\u1ed1ng sung t\u00fac, vinh hoa, t\u01b0\u01a1ng lai t\u01b0\u01a1i s\u00e1ng", "sex": 5}
