{"first_name": "\u00c1i Th\u00f9y", "meaning": "\"\u00c1i\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a. \"\u00c1i\" c\u00f2n \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 n\u00f3i v\u1ec1 ng\u01b0\u1eddi ph\u1ee5 n\u1eef c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, \u0111oan trang. \"Th\u00f9y\" c\u00f3 ngh\u0129a l\u00e0 th\u00f9y m\u1ecb, n\u1ebft na, \u0111\u1eb1m th\u1eafm.  \"\u00c1i Th\u00f9y\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con lu\u00f4n xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, \u0111\u00e1ng y\u00eau. Cu\u1ed9c \u0111\u1eddi con c\u0169ng nh\u1eb9 nh\u00e0ng nh\u01b0 t\u00ednh c\u00e1ch c\u1ee7a con v\u1eady", "sex": 5}
