{"first_name": "Anh Th\u00f9y", "meaning": "Ch\u1eef \"Anh\" g\u1ee3i l\u00ean s\u1ef1 tinh anh, hi\u1ec3u bi\u1ebft, nhanh nh\u1eb9n. \"Th\u00f9y\" l\u00e0 th\u00f9y m\u1ecb, n\u1ebft na. T\u00ean \"Anh Th\u00f9y\" mang \u00fd ngh\u0129a con g\u00e1i c\u1ee7a b\u1ed1 m\u1eb9 v\u1eeba th\u00f9y m\u1ecb, d\u1ec5 th\u01b0\u01a1ng, v\u1eeba tinh th\u00f4ng m\u1ecdi vi\u1ec7c 1 c\u00e1ch nh\u1eb9 nh\u00e0ng nh\u01b0ng s\u00e2u s\u1eafc.", "sex": 5}
{"first_name": "\u00c1nh Th\u00f9y", "meaning": "\"\u00c1nh\" theo ngh\u0129a H\u00e1n Vi\u1ec7t g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng tia s\u00e1ng do m\u1ed9t v\u1eadt ph\u00e1t ra ho\u1eb7c ph\u1ea3n chi\u1ebfu l\u1ea1i, \u00e1nh s\u00e1ng ph\u1ea3n chi\u1ebfu l\u00f3ng l\u00e1nh, soi r\u1ecdi. V\u1edbi t\u00ean g\u1ecdi \"\u00c1nh Th\u00f9y\", b\u1ed1 m\u1eb9 mong con g\u00e1i mang v\u1ebb \u0111\u1eb9p d\u1ecbu d\u00e0ng, hi\u1ec1n h\u1eadu, d\u1ec5 th\u01b0\u01a1ng, m\u1ed9t c\u00f4 g\u00e1i n\u1ebft na, thu\u1ef3 m\u1ecb \u0111oan trang,  th\u00f4ng minh v\u00e0 am hi\u1ec3u", "sex": 5}
