{"first_name": "D\u01b0\u01a1ng Th\u00f9y", "meaning": "\"\"\"D\u01b0\u01a1ng\"\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ea1i d\u01b0\u01a1ng, g\u1ee3i l\u00ean v\u1ebb \u0111\u1eb9p bao la, r\u1ed9ng l\u1edbn, \"\"Th\u00f9y\"\" g\u1ee3i l\u00ean s\u1ef1 th\u00f9y m\u1ecb, n\u1ebft na, \u0111\u1eb1m th\u1eafm, d\u1ecbu d\u00e0ng. C\u00e1i t\u00ean \"\"D\u01b0\u01a1ng Th\u00f9y\"\" g\u1ee3i l\u00ean v\u1ebb \u0111\u1eb9p d\u1ecbu d\u00e0ng, thu\u1ef3 m\u1ecb, n\u1ebft na c\u00f9ng v\u1edbi m\u1ed9t t\u1ea5m l\u00f2ng bao dung r\u1ed9ng m\u1edf nh\u01b0 \u0111\u1ea1i d\u01b0\u01a1ng bao la.\r\n\"", "sex": 5}
{"first_name": "Duy\u00ean Th\u00f9y", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t  \"Th\u00f9y\" c\u00f3 ngh\u0129a l\u00e0 th\u00f9y m\u1ecb, n\u1ebft na, \u0111\u1eb1m th\u1eafm, \"Th\u00f9y\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con lu\u00f4n xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, \u0111\u00e1ng y\u00eau. \"Duy\u00ean\" ngh\u0129a l\u00e0 s\u1ef1 h\u00e0i ho\u00e0 \u0111\u00e1ng y\u00eau t\u1ea1o n\u00ean v\u1ebb h\u1ea5p d\u1eabn t\u1ef1 nhi\u00ean c\u1ee7a ng\u01b0\u1eddi con g\u00e1i.V\u1edbi t\u00ean \"Duy\u00ean Th\u00f9y\", ba m\u1eb9  mong mu\u1ed1n con lu\u00f4n xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, \u0111\u00e1ng y\u00eau,th\u00f9y m\u1ecb n\u1ebft na \u0111\u1eb1m th\u1eafm.", "sex": 5}
{"first_name": "Giang Th\u00f9y", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t  \"Th\u00f9y\" c\u00f3 ngh\u0129a l\u00e0 th\u00f9y m\u1ecb, n\u1ebft na, \u0111\u1eb1m th\u1eafm.  \"Th\u00f9y\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con lu\u00f4n xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, \u0111\u00e1ng y\u00eau. \"Giang\" l\u00e0 d\u00f2ng s\u00f4ng, th\u01b0\u1eddng ch\u1ec9 nh\u1eefng \u0111i\u1ec1u cao c\u1ea3, l\u1edbn lao. \"Giang Th\u00f9y\" l\u00e0 c\u00e1i t\u00ean th\u1ec3 hi\u1ec7n mong mu\u1ed1n c\u1ee7a ba m\u1eb9 r\u1eb1ng con l\u00e0 ng\u01b0\u1eddi th\u00f9y m\u1ecb , \u0111\u1eb1m th\u1eafm, xinh \u0111\u1eb9p d\u1ecbu d\u00e0ng d\u00e1ng y\u00eau, cu\u1ed9c s\u1ed1ng lu\u00f4n \u00eam \u1ea3, nh\u1eb9 nh\u00e0ng nh\u01b0 d\u00f2ng s\u00f4ng.", "sex": 5}
{"first_name": "Giao Th\u00f9y", "meaning": "Theo t\u1eeb \u0111i\u1ec3n Ti\u1ebfng Vi\u1ec7t, \"Th\u00f9y\" c\u00f3 ngh\u0129a l\u00e0 th\u00f9y m\u1ecb, n\u1ebft na, \u0111\u1eb1m th\u1eafm.  \"Giao\" l\u00e0 t\u00ean c\u1ee7a lo\u00e0i c\u1ecf giao b\u00ecnh d\u1ecb. \"Giao Th\u00f9y\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con lu\u00f4n xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, \u0111\u00e1ng y\u00eau. Cu\u1ed9c \u0111\u1eddi con c\u0169ng nh\u1eb9 nh\u00e0ng, b\u00ecnh d\u1ecb nh\u01b0ng gi\u00e0u s\u1ee9c s\u1ed1ng m\u00e3nh li\u1ec7t, m\u1ea1nh m\u1ebd v\u00e0 kh\u00f4ng d\u1ec5 \u0111\u1ea7u h\u00e0ng.", "sex": 5}
