{"first_name": "Linh Th\u00f9y", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Linh\" c\u00f3 ngh\u0129a l\u00e0 c\u00e1i chu\u00f4ng nh\u1ecf \u0111\u00e1ng y\u00eau, \"Th\u00f9y\" c\u00f3 ngh\u0129a l\u00e0 th\u00f9y m\u1ecb, n\u1ebft na. T\u00ean \"Linh Th\u00f9y\"  mang \u00fd ngh\u0129a con l\u00e0 c\u00f4 g\u00e1i xinh \u0111\u1eb9p, th\u00f4ng minh lanh l\u1ee3i & t\u00ednh t\u00ecnh th\u00f9y m\u1ecb \u0111\u00e1ng y\u00eau", "sex": 5}
{"first_name": "Mai Th\u00f9y", "meaning": "Theo t\u1eeb \u0111i\u1ec5n Ti\u1ebfng Vi\u1ec7t, \"Mai\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p, thu\u1ed9c b\u1ed9 t\u1ee9 qu\u00fd, hoa m\u00e0u v\u00e0ng, c\u00f3 n\u0103m c\u00e1nh t\u01b0\u1ee3ng tr\u01b0ng cho ng\u0169 ph\u00fac. Tuy hoa mai m\u1ecfng manh nh\u01b0ng t\u01b0\u1ee3ng tr\u01b0ng cho kh\u00ed ti\u1ebft c\u1ee7a ng\u01b0\u1eddi qu\u00e2n t\u1eed. \"Th\u00f9y\" c\u00f3 ngh\u0129a l\u00e0 th\u00f9y m\u1ecb, n\u1ebft na, d\u1ecbu d\u00e0ng. T\u00ean  \"Mai Th\u00f9y\" th\u1ec3 hi\u1ec7n ni\u1ec1m k\u1ef3 v\u1ecdng sau n\u00e0y con s\u1ebd l\u00e0 m\u1ed9t c\u00f4 g\u00e1i d\u1ecbu d\u00e0ng, th\u00f9y m\u1ecb nh\u01b0ng c\u01b0\u01a1ng quy\u1ebft, ngh\u1ecb l\u1ef1c v\u00e0 b\u1ea3n l\u0129nh, c\u00f3 c\u00e1i t\u00e2m trong s\u1ea1ch, c\u00f3 ch\u00ed khi\u0301 thanh cao...", "sex": 5}
