{"first_name": "Minh Th\u00f9y", "meaning": "\"Minh\" ngh\u0129a l\u00e0 th\u00f4ng minh t\u00e0i tr\u00ed hay c\u00f2n c\u00f3 ngh\u0129a l\u00e0 b\u1eaft \u0111\u1ea7u nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. \"Th\u00f9y\" l\u00e0 th\u00f9y m\u1ecb, d\u1ecbu d\u00e0ng. \"Minh Th\u00f9y\" ngh\u0129a l\u00e0 con v\u1eeba th\u00f4ng minh, s\u00e1ng d\u1ea1 v\u1eeba th\u00f9y m\u1ecb, d\u1ecbu d\u00e0ng.", "sex": 5}
{"first_name": "My Th\u00f9y", "meaning": "\"My\" c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p,  \u0111\u00e1ng y\u00eau. \"Th\u00f9y\" l\u00e0 th\u00f9y m\u1ecb, d\u1ecbu d\u00e0ng. \"My Th\u00f9y\" l\u00e0 c\u00e1i t\u00ean v\u1edbi mong mu\u1ed1n l\u00e0 con xinh \u0111\u1eb9p, th\u00f9y m\u1ecb.", "sex": 5}
{"first_name": "Nga Th\u00f9y", "meaning": "\"Nga\" l\u00e0 t\u1eeb hoa m\u1ef9 d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p, th\u01b0\u1edbt tha xinh nh\u01b0 ti\u00ean. \"Th\u00f9y\" l\u00e0 th\u00f9y m\u1ecb, d\u1ecbu d\u00e0ng. \"Nga Th\u00f9y\" l\u00e0 con g\u00e1i \u0111\u1eb9p, th\u00f9y m\u1ecb, n\u1ebft na.", "sex": 5}
{"first_name": "Ng\u00e2n Th\u00f9y", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a. Theo t\u1eeb \u0111i\u1ec3n Ti\u1ebfng Vi\u1ec7t, \"Th\u00f9y\" c\u00f3 ngh\u0129a l\u00e0 th\u00f9y m\u1ecb, n\u1ebft na, \u0111\u1eb1m th\u1eafm. \"Ng\u00e2n Th\u00f9y\" ngh\u0129a l\u00e0 cha m\u1eb9 mong cho con c\u00f3 t\u01b0\u01a1ng lai \u1ea5m no, \u0111\u1ea7y \u0111\u1ee7, b\u1ea3n t\u00ednh ngoan hi\u1ec1n th\u00f9y m\u1ecb.", "sex": 5}
