{"first_name": "Nguy\u1ec7t Th\u00f9y", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, nguy\u1ec7t l\u00e0 v\u1ea7ng tr\u0103ng, Tr\u0103ng c\u00f3 v\u1ebb \u0111\u1eb9p v\u00f4 c\u00f9ng b\u00ecnh d\u1ecb, m\u1ed9t v\u1ebb \u0111\u1eb9p kh\u00f4ng c\u1ea7n trang s\u1ee9c, \u0111\u1eb9p m\u1ed9t c\u00e1ch v\u00f4 t\u01b0, h\u1ed3n nhi\u00ean. Tr\u0103ng t\u01b0\u1ee3ng tr\u01b0ng cho v\u1ebb \u0111\u1eb9p h\u1ed3n nhi\u00ean n\u00ean tr\u0103ng ho\u00e0 v\u00e0o thi\u00ean nhi\u00ean, ho\u00e0 v\u00e0o c\u00e2y c\u1ecf. \u0110\u1eb7t t\u00ean Nguy\u1ec7t Th\u00f9y v\u1edbi \u00fd ngh\u0129a mong con xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, th\u00f9y m\u1ecb, n\u1ebft na, gi\u1ea3n d\u1ecb, lu\u00f4n vui t\u01b0\u01a1i", "sex": 5}
{"first_name": "Nh\u00e3 Th\u00f9y", "meaning": "\"Nh\u00e3\" v\u00e0 \"Th\u00f9y\" \u0111\u1ec1u l\u00e0 nh\u1eefng t\u1eeb t\u00f4n l\u00ean v\u1ebb \u0111\u1eb9p n\u1ed9i t\u00e2m c\u1ee7a ng\u01b0\u1eddi con g\u00e1i, v\u1eeba xinh \u0111\u1eb9p, th\u00f9y m\u1ecb, n\u1ebft na, v\u1eeba gi\u1ea3n d\u1ecb, m\u1ed9c m\u1ea1c, khi\u00eam nh\u01b0\u1eddng, r\u1ea5t \u0111\u00e1ng y\u00eau. V\u00ec v\u1eady t\u00ean \"Nh\u00e3 Th\u00f9y\" l\u00e0 ni\u1ec1m y\u00eau th\u01b0\u01a1ng c\u1ee7a cha m\u1eb9 d\u00e0nh cho con y\u00eau, mong con xinh \u0111\u1eb9p nh\u01b0 ch\u00ednh c\u00e1i t\u00ean c\u1ee7a m\u00ecnh", "sex": 5}
