{"first_name": "Ph\u01b0\u01a1ng Th\u00f9y", "meaning": "Ch\u1eef \"Ph\u01b0\u01a1ng\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m, ti\u1ebfng th\u01a1m. C\u00f2n \"Th\u00f9y\" c\u00f3 ngh\u0129a l\u00e0 th\u00f9y m\u1ecb, n\u1ebft na, \u0111\u1eb1m th\u1eafm, d\u1ecbu d\u00e0ng. T\u00ean \"Ph\u01b0\u01a1ng Th\u00f9y\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, duy\u00ean d\u00e1ng, \u0111\u1ee9c h\u1ea1nh, co\u0301 t\u1ea5m l\u00f2ng th\u01a1m th\u1ea3o.", "sex": 5}
