{"first_name": "C\u00e1t Th\u1ee7y", "meaning": "\" Th\u1ee7y\"L\u00e0 n\u01b0\u1edbc, m\u1ed9t trong nh\u1eefng y\u1ebfu t\u1ed1 kh\u00f4ng th\u1ec3 thi\u1ebfu trong \u0111\u1eddi s\u1ed1ng con ng\u01b0\u1eddi. \"C\u00e1t\" trong ch\u1eef \"C\u00e1t T\u01b0\u1eddng\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng s\u1ef1 vi\u1ec7c vui m\u1eebng, mang c\u1ea3m gi\u00e1c h\u00e2n hoan, th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 di\u1ec5n t\u1ea3 nh\u1eefng \u0111i\u1ec1u may m\u1eafn, t\u1ed1t l\u00e0nh. T\u00ean con \"C\u00e1t Th\u1ee7y\" ng\u1ee5 \u00fd r\u1eb1ng ni\u1ec1m vui trong cu\u1ed9c \u0111\u1eddi con l\u00e0 \u0111i\u1ec1u t\u1ea5t y\u1ebfu v\u00e0 mong con c\u00f3 th\u1ebf mang l\u1ea1i c\u1ea3m gi\u00e1c vui t\u01b0\u01a1i, hoan h\u1ec9 v\u00e0 nhi\u1ec1u ph\u00fac l\u00e0nh cho nh\u1eefng ng\u01b0\u1eddi xung quanh.", "sex": 5}
