{"first_name": "H\u1ea1nh Th\u1ee7y", "meaning": "Theo H\u00e1n - Vi\u1ec7t, t\u00ean \"H\u1ea1nh\" c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 ph\u00fac l\u1ed9c, l\u00e0 ph\u01b0\u1edbc l\u00e0nh, c\u00f2n c\u00f3 ngh\u0129a l\u00e0 t\u00ednh n\u1ebft, \u0111\u1ee9c h\u1ea1nh c\u1ee7a con ng\u01b0\u1eddi. T\u00ean \"H\u1ea1nh Th\u1ee7y\" th\u01b0\u1eddng d\u00f9ng cho n\u1eef, ch\u1ec9 ng\u01b0\u1eddi n\u1ebft na, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, \u0111\u00f4n h\u1eadu, ph\u1ea9m ch\u1ea5t cao \u0111\u1eb9p.", "sex": 5}
