{"first_name": "Ng\u1ecdc Ti\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ng\u1ecdc\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn v\u1eadt tr\u00e2n qu\u00fd, qu\u00fd b\u00e1u, \"Ti\u00ean\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn c\u00e1c nh\u00e2n v\u1eadt th\u1ea7n tho\u1ea1i \u0111\u1eb9p v\u00e0 c\u00f3 ph\u00e9p m\u00e0u. \"Ng\u1ecdc Ti\u00ean\" c\u00f3 ngh\u0129a l\u00e0 b\u1ea3o b\u1ed1i c\u1ee7a c\u00e1c v\u1ecb ti\u00ean. T\u00ean \"Ng\u1ecdc Ti\u00ean\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi xinh \u0111\u1eb9p, cao sang, quy\u1ec1n qu\u00fd, c\u00f3 t\u1ea5m l\u00f2ng nh\u00e2n h\u1eadu, \u00f4n h\u00f2a, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi th\u01b0\u01a1ng y\u00eau, chi\u1ec1u chu\u1ed9ng.", "sex": 5}
