{"first_name": "Duy T\u00edn", "meaning": "Duy trong ti\u1ebfng h\u00e1n vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u01b0 duy, suy ngh\u0129 th\u1ea5u \u0111\u00e1o. Ng\u01b0\u1eddi t\u00ean \"Duy T\u00edn\"  th\u01b0\u1eddng bi\u1ebft b\u00ecnh t\u0129nh gi\u1ea3i quy\u1ebft v\u1ea5n \u0111\u1ec1 kh\u00f4ng b\u1ed9p ch\u1ed9p h\u00e0nh x\u1eed, c\u00f3 tr\u00ed tu\u1ec7, th\u00f4ng minh & tinh t\u01b0\u1eddng, t\u1ea1o n\u00ean s\u1ef1 tin c\u1eady tuy\u1ec7t \u0111\u1ed1i v\u1edbi ng\u01b0\u1eddi th\u00e2n", "sex": 3}
{"first_name": "M\u1ea1nh T\u00edn", "meaning": "\"M\u1ea1nh\" l\u00e0 m\u1ea1nh t\u1eed ch\u1ec9 ng\u01b0\u1eddi c\u00f3 h\u1ecdc, v\u00f3c d\u00e1ng kh\u1ecfe m\u1ea1nh, t\u00ednh m\u1ea1nh m\u1ebd. T\u00ean \"M\u1ea1nh T\u00edn\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, kh\u1ecfe m\u1ea1nh, b\u1ea3n l\u0129nh, qu\u00e2n t\u1eed, \u0111\u00e1ng tin c\u1eady", "sex": 3}
{"first_name": "Minh T\u00edn", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, Minh c\u00f2n c\u00f3 ngh\u0129a ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (b\u00ecnh minh) th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. T\u00ean \"Minh T\u00edn\" th\u1ec3 hi\u1ec7n m\u1ed9t n\u1ec1m tin tuy\u1ec7t \u0111\u1ed1i c\u1ee7a cha m\u1eb9 r\u1eb1ng con m\u00ecnh s\u1ebd l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh, hi\u1ec3u bi\u1ebft, \u0111\u00e1ng tin c\u1eady", "sex": 3}
