{"first_name": "\u0110\u1ea1i Ti\u1ebfn", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Ti\u1ebfn\" l\u00e0 s\u1ef1 v\u01b0\u01a1n t\u1edbi th\u1ec3 hi\u1ec7n \u00fd ch\u00ed n\u1ed7 l\u1ef1c c\u1ee7a con ng\u01b0\u1eddi. T\u00ean \"Ti\u1ebfn\" c\u00f2n h\u00e0m ch\u1ee9a \u00fd ngh\u0129a mong con lu\u00f4n th\u00e0nh c\u00f4ng, ti\u1ebfn b\u01b0\u1edbc tr\u00ean \u0111\u01b0\u1eddng \u0111\u1eddi.\"\u0110\u1ea1i\" di\u1ec5n t\u1ea3 s\u1ef1 to l\u1edbn, b\u00e1ch \u0111\u1ea1i, \u0111\u1ea1i gia, c\u00f3 th\u1ec3 l\u00e0m ch\u1ed7 d\u1ef1a v\u1eefng ch\u1eafc cho m\u1ecdi ng\u01b0\u1eddi, c\u00f2n th\u1ec3 hi\u1ec7n tinh th\u1ea7n qu\u1ea3ng \u0111\u1ea1i, s\u1ef1 r\u1ed9ng r\u00e3i, quang minh ch\u00ednh \u0111\u1ea1i. \"\u0110\u1ea1i Ti\u1ebfn\", ba m\u1eb9 mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi quang minh ch\u00ednh \u0111\u1ea1i, c\u00f3 s\u1ef1 nghi\u1ec7p v\u1eefng ch\u1eafc v\u00e0 c\u00f3 nh\u1eefng b\u01b0\u1edbc ti\u1ebfn t\u1ed1t \u0111\u1eb9p trong t\u01b0\u01a1ng lai.", "sex": 3}
{"first_name": "\u0110ang Ti\u1ebfn", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Ti\u1ebfn\" l\u00e0 s\u1ef1 v\u01b0\u01a1n t\u1edbi th\u1ec3 hi\u1ec7n \u00fd ch\u00ed n\u1ed7 l\u1ef1c c\u1ee7a con ng\u01b0\u1eddi, h\u00e0m ch\u1ee9a \u00fd ngh\u0129a th\u00e0nh c\u00f4ng. \"\u0110\u0103ng\" c\u00f3 ngh\u0129a l\u00e0 ng\u1ecdn \u0111\u00e8n, mang \u00fd ngh\u0129a l\u00e0 s\u1ef1 soi s\u00e1ng, tinh anh.\"\u0110\u0103ng Ti\u1ebfn\" l\u00e0 c\u00e1i t\u00ean th\u1ec3 hi\u1ec7n mong mu\u1ed1n c\u1ee7a cha m\u1eb9 r\u1eb1ng con l\u00e0 ng\u01b0\u1eddi c\u00f3 \u00fd ch\u00ed c\u1ea7u ti\u1ebfn n\u1ed7 l\u1ef1c v\u01b0\u01a1n l\u00ean v\u00e0 \u0111\u1ea1t \u0111\u01b0\u1ee3c th\u00e0nh c\u00f4ng trong cu\u1ed9c s\u1ed1ng sau n\u00e0y.", "sex": 3}
