{"first_name": "\u0110\u1ecbnh Ti\u1ebfn", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ti\u1ebfn\" l\u00e0 s\u1ef1 v\u01b0\u01a1n t\u1edbi th\u1ec3 hi\u1ec7n \u00fd ch\u00ed n\u1ed7 l\u1ef1c c\u1ee7a con ng\u01b0\u1eddi. \"\u0110\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 ki\u00ean \u0111\u1ecbnh, kh\u00f4ng \u0111\u1ed5i d\u1eddi, b\u1ea5t bi\u1ebfn. T\u00ean \"\u0110\u1ecbnh\" \u00fd ch\u1ec9 v\u1ec1 t\u00ednh c\u00e1ch con ng\u01b0\u1eddi ki\u00ean \u0111\u1ecbnh, r\u1ea1ch r\u00f2i. V\u1edbi t\u00ean \"\u0110\u1ecbnh Ti\u1ebfn\", ba m\u1eb9 mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi th\u00e0nh c\u00f4ng trong cu\u1ed9c s\u1ed1ng , c\u00f3 nh\u1eefng n\u1ed7 l\u1ef1c ph\u1ea5n \u0111\u1ea5u, bi\u1ebft \u0111\u1eb7t m\u1ee5c ti\u00ean ph\u1ea5n \u0111\u1ea5u \u0111\u1ec3 th\u0103ng ti\u1ebfn trong cu\u1ed9c s\u1ed1ng.", "sex": 3}
{"first_name": "\u0110o\u00e0n Ti\u1ebfn", "meaning": "\"\u0110o\u00e0n Ti\u1ebfn\", mong con l\u00e0 s\u1ebd th\u0103ng ti\u1ebfn trong c\u00f4ng vi\u1ec7c.", "sex": 3}
{"first_name": "\u0110\u1ee9c Ti\u1ebfn", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\u0110\u1ee9c\" l\u00e0 nh\u1eefng \u0111\u1ee9c t\u00ednh t\u1ed1t, \u0111\u1ea1o l\u00ed l\u00e0m ng\u01b0\u1eddi, \"Ti\u1ebfn\" ngh\u0129a l\u00e0 ph\u00eda tr\u01b0\u1edbc. \"\u0110\u1ee9c Ti\u1ebfn\" l\u00e0 c\u00e1i t\u00ean d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, hi\u1ec3u bi\u1ebft, c\u00f3 \u0111\u1ea1o \u0111\u1ee9c, c\u00f3 ch\u00ed ti\u1ebfn th\u1ee7, c\u00f3 ch\u00ed h\u01b0\u1edbng, lu\u00f4n bi\u1ebft h\u01b0\u1edbng v\u1ec1 ph\u00eda tr\u01b0\u1edbc v\u00e0 \u0111\u1ea1t t\u1edbi th\u00e0nh c\u00f4ng.", "sex": 3}
