{"first_name": "Khoa Ti\u1ebfn", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Ti\u1ebfn\" l\u00e0 s\u1ef1 v\u01b0\u01a1n t\u1edbi th\u1ec3 hi\u1ec7n \u00fd ch\u00ed n\u1ed7 l\u1ef1c c\u1ee7a con ng\u01b0\u1eddi. \"Khoa\" th\u01b0\u1eddng mang h\u00e0m \u00fd t\u1ed1t \u0111\u1eb9p, ch\u1ec9 s\u1ef1 vi\u1ec7c to l\u1edbn, d\u00f9ng \u0111\u1ec3 n\u00f3i v\u1ec1 ng\u01b0\u1eddi c\u00f3 \u0111\u1ecba v\u1ecb x\u00e3 h\u1ed9i v\u00e0 tr\u00ecnh \u0111\u1ed9 h\u1ecdc v\u1ea5n. Theo v\u0103n h\u00f3a c\u1ee7a ng\u01b0\u1eddi x\u01b0a, c\u00e1c \u0111\u1ea5ng nam nhi th\u01b0\u1eddng l\u1ea5y c\u00f4ng danh \u0111\u1ed7 \u0111\u1ea1t l\u00e0m tr\u1ecdng n\u00ean t\u00ean \"Khoa\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 mong mu\u1ed1n con c\u00e1i sau n\u00e0y t\u00e0i n\u0103ng, th\u00f4ng minh, ham h\u1ecdc h\u1ecfi, s\u1edbm \u0111\u1ed7 \u0111\u1ea1t th\u00e0nh danh.V\u1edbi t\u00ean \"Khoa Ti\u1ebfn\", ba m\u1eb9 mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh t\u00e0i gi\u1ecfi c\u00f3 \u00fd ch\u00ed, n\u1ed7 l\u1ef1c ph\u1ea5n \u0111\u1ea5u v\u00e0 th\u00e0nh c\u00f4ng trong cu\u1ed9c s\u1ed1ng.", "sex": 3}
