{"first_name": "Anh Th\u1ee9c", "meaning": "Ch\u1eef Anh theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 \u201cng\u01b0\u1eddi t\u00e0i gi\u1ecfi\u201d v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n, v\u00ec v\u1eady t\u00ean \"Anh Th\u1ee9c\" th\u1ec3 hi\u1ec7n mong mu\u1ed1n t\u1ed1t \u0111\u1eb9p c\u1ee7a cha m\u1eb9 \u0111\u1ec3 con m\u00ecnh th\u00f4ng minh, tr\u00ed tu\u1ec7, s\u1ed1ng c\u00f3 ph\u00e9p t\u1eafc, l\u1ec5 nghi, gi\u1ecfi giang xu\u1ea5t ch\u00fang", "sex": 3}
{"first_name": "\u0110\u0103ng Th\u1ee9c", "meaning": "\u0110\u0103ng trong ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ng\u1ecdn \u0111\u00e8n, g\u1ee3i \u0111\u1ebfn s\u1ef1 soi s\u00e1ng & tinh anh. T\u00ean \"\u0110\u0103ng Th\u1ee9c\" th\u1ec3 hi\u1ec7n mong mu\u1ed1n v\u1ec1 m\u1ed9t tri th\u1ee9c to\u00e0n di\u1ec7n, s\u1ef1 tinh th\u00f4ng, hi\u1ec3u bi\u1ebft c\u1ee7a nh\u1eefng con ng\u01b0\u1eddi s\u1ed1ng c\u00f3 chu\u1ea9n m\u1ef1c, khu\u00f4n ph\u00e9p, lu\u00f4n b\u00ecnh t\u0129nh, \u0111i\u1ec1m \u0111\u1ea1m tr\u01b0\u1edbc nh\u1eefng s\u00f3ng gi\u00f3 cu\u1ed9c \u0111\u1eddi", "sex": 3}
{"first_name": "\u0110\u1ea1t Th\u1ee9c", "meaning": "\u0110\u1ea1t trong ti\u1ebfng h\u00e1n vi\u1ec7t th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 v\u1ec1 s\u1ef1 th\u00e0nh c\u00f4ng, v\u1ecb th\u1ebf cao sang & tr\u00ed tu\u1ec7 th\u00f4ng su\u1ed1t, th\u1ea5u t\u00ecnh \u0111\u1ea1t l\u00fd c\u1ee7a con ng\u01b0\u1eddi. T\u00ean \u0110\u1ea1t Th\u1ee9c mang \u00fd ngh\u0129a con s\u1ebd l\u00e0 ng\u01b0\u1eddi tr\u00ed tu\u1ec7, c\u00f3 hi\u1ebfu bi\u1ebft & th\u00e0nh c\u00f4ng, \u0111\u1ed7 \u0111\u1ea1t trong s\u1ef1 nghi\u1ec7p", "sex": 3}
{"first_name": "\u0110\u00f4ng Th\u1ee9c", "meaning": "\u0110\u00f4ng l\u00e0 m\u00f9a \u0111\u00f4ng, m\u1ed9t trong b\u1ed1n m\u00f9a t\u1ea1o n\u00ean v\u00f2ng xoay \u0111\u1ea5t tr\u1eddi. Th\u01b0\u1eddng m\u00f9a \u0111\u00f4ng l\u1ea1nh s\u1ebd khi\u1ebfn con ng\u01b0\u1eddi nh\u1edb \u0111\u1ebfn c\u1ea3m gi\u00e1c \u1ea5m \u00e1p, xum v\u1ea7y b\u00ean nh\u1eefng ng\u01b0\u1eddi th\u00e2n y\u00eau, v\u00ec th\u1ebf m\u00f9a \u0111\u00f4ng th\u01b0\u1eddng t\u1ea1o cho con ng\u01b0\u1eddi c\u1ea3m gi\u00e1c nh\u1edb nhung, bi\u1ebft ch\u1edd \u0111\u1ee3i. T\u00ean \u0110\u00f4ng Th\u1ee9c \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi t\u1ec9nh t\u00e1o, th\u00e1i \u0111\u1ed9 b\u00ecnh t\u0129nh, s\u00e2u s\u1eafc & l\u00e0 ng\u01b0\u1eddi c\u00f3 khuynh h\u01b0\u1edbng thi\u00ean v\u1ec1 gia \u0111\u00ecnh", "sex": 3}
