{"first_name": "Ng\u1ecdc Th\u1ee9c", "meaning": "\"Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh,... th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed. T\u00ean Ng\u1ecdc Th\u1ee9c th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, thanh cao, c\u00f3 tri th\u1ee9c, s\u1ed1ng c\u00f3 nguy\u00ean t\u1eafc, c\u00f3 t\u00ecnh ngh\u0129a", "sex": 3}
