{"first_name": "Thanh Th\u1ee9c", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 m\u00e0u xanh, tu\u1ed5i tr\u1ebb, c\u00f2n l\u00e0 s\u1ef1 thanh cao, trong s\u1ea1ch, thanh b\u1ea1ch. Ng\u01b0\u1eddi t\u00ean \"Thanh Th\u1ee9c\" th\u01b0\u1eddng c\u00f3 h\u1ecdc th\u1ee9c, s\u1ed1ng c\u00f3 ph\u00e9p t\u1eafc, khu\u00f4n m\u1eabu, kh\u00ed ch\u1ea5t \u0111i\u1ec1m \u0111\u1ea1m, nh\u1eb9 nh\u00e0ng v\u00e0 cao qu\u00fd", "sex": 3}
