{"first_name": "Kh\u00e1nh To\u00e0n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Kh\u00e1nh\" l\u00e0 s\u1ef1 ch\u00fac m\u1eebng, s\u1ef1 vui v\u1ebb, \"To\u00e0n\" l\u00e0 s\u1ef1 ph\u1ed5 bi\u1ebfn r\u1ed9ng kh\u1eafp. T\u00ean \"Kh\u00e1nh To\u00e0n\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c g\u1eedi g\u1eafm v\u1edbi \u00fd ngh\u0129a v\u1ec1 m\u1ed9t cu\u1ed9c s\u1ed1ng vui v\u1ebb tr\u1ecdn v\u1eb9n; s\u1ef1 ra \u0111\u1eddi c\u1ee7a con l\u00e0 ni\u1ec1m vui, ni\u1ec1m h\u00e2n hoan c\u1ee7a m\u1ecdi ng\u01b0\u1eddi.", "sex": 3}
{"first_name": "Minh To\u00e0n", "meaning": "Theo ngh\u0129a H\u00e1n -Vi\u1ec7t, \"Minh\" c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, hi\u1ec3u bi\u1ebft, s\u00e1ng su\u1ed1t, \"To\u00e0n\" c\u00f3 ngh\u0129a l\u00e0 tr\u1ecdn v\u1eb9n, \u0111\u1ea7y \u0111\u1ee7, kh\u00f4ng thi\u1ebfu s\u00f3t. T\u00ean \"Minh To\u00e0n\" th\u1ec3 hi\u1ec7n mong mu\u1ed1n cho con c\u00f3 \u0111\u01b0\u1ee3c m\u1ed9t tr\u00ed tu\u1ec7, tr\u00ed th\u00f4ng minh ho\u00e0n h\u1ea3o, kh\u00f4ng khi\u1ebfm khuy\u1ebft.", "sex": 3}
{"first_name": "M\u1ef9 To\u00e0n", "meaning": "\"M\u1ef9\" c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p, t\u1ed1t l\u00e0nh. \"To\u00e0n\" ngh\u0129a l\u00e0 \u0111\u1ea7y \u0111\u1ee7 tr\u1ecdn v\u1eb9, \"M\u1ef9 To\u00e0n\" ngh\u0129a l\u00e0 con xinh \u0111\u1eb9p, to\u00e0n v\u1eb9n, t\u1eeb dung m\u1ea1o \u0111\u1ebfn t\u00ednh t\u00ecnh.", "sex": 5}
{"first_name": "Nam To\u00e0n", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam To\u00e0n \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con t\u00e0i gi\u1ecfi, kh\u1ecfe m\u1ea1nh, th\u00e0nh c\u00f4ng", "sex": 3}
