{"first_name": "Anh T\u1ed1", "meaning": "Ch\u1eef Anh theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 \u201cng\u01b0\u1eddi t\u00e0i gi\u1ecfi\u201d v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang. \"T\u1ed1\" l\u00e0 m\u1ed9t t\u1eeb th\u01b0\u01a1\u0300ng \u0111i ke\u0300m d\u00f9ng \u0111\u1ec3 di\u1ec5n t\u1ea3 m\u1ed9t ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p. Ng\u01b0\u1eddi con g\u00e1i \u0111\u01b0\u1ee3c \u0111\u1eb7t t\u00ean l\u00e0 Anh T\u1ed1  l\u00e0 ch\u1ec9 s\u1ef1 mong \u01b0\u1edbc c\u1ee7a cha m\u1eb9 sau n\u00e0y con s\u1ebd xinh \u0111\u1eb9p va\u0300 ta\u0300i gio\u0309i tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n.", "sex": 5}
