{"first_name": "C\u1ea7m T\u1ed1", "meaning": "\"T\u1ed1\" l\u00e0 m\u1ed9t t\u1eeb d\u00f9ng \u0111\u1ec3 di\u1ec5n t\u1ea3 m\u1ed9t ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p. \"C\u1ea7m\" theo ti\u1ebfng H\u00e1n-Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 \u0111\u00e0n, th\u1ec3 hi\u1ec7n n\u1ebfp s\u1ed1ng thanh tao, an nh\u00e0n, t\u1ef1 t\u1ea1i v\u00e0 t\u00e0i ngh\u1ec7 kh\u00e9o l\u00e9o. Ng\u01b0\u1eddi con g\u00e1i \u0111\u01b0\u1ee3c \u0111\u1eb7t t\u00ean \"C\u1ea7m T\u1ed1 \" l\u00e0 ch\u1ec9 s\u1ef1 mong \u01b0\u1edbc c\u1ee7a b\u1ed1 m\u1eb9 sau n\u00e0y con s\u1ebd xinh \u0111\u1eb9p \"m\u01b0\u1eddi ph\u00e2n v\u1eb9n m\u01b0\u1eddi\", kh\u00f4ng nh\u1eefng th\u1ebf con c\u00f2n c\u00f3 t\u00e0i ngh\u1ec7 tinh hoa, th\u00f4ng th\u1ea1o.", "sex": 5}
