{"first_name": "Thanh T\u1ed1", "meaning": "\"Thanh\" l\u00e0 trong s\u1ea1ch, li\u00eam khi\u1ebft. \"T\u1ed1\" l\u00e0 m\u1ed9c m\u1ea1c, cao khi\u1ebft, kh\u00f4ng ph\u00f4 tr\u01b0\u01a1ng. T\u00ean \"Thanh T\u1ed1\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau, m\u1ed9c m\u1ea1c b\u00ecnh d\u1ecb, thanh cao, kh\u1ea3 \u00e1i", "sex": 5}
