{"first_name": "Uy\u00ean T\u1ed1", "meaning": "\"Uy\u00ean\" theo ti\u1ebfng H\u00e1n -Vi\u1ec7t \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. C\u1ea3 \"Uy\u00ean\" v\u00e0 \"T\u1ed1\" \u0111\u1ec1u d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ph\u1ea9m h\u1ea1nh n\u1ebft na c\u1ee7a ng\u01b0\u1eddi ph\u1ee5 n\u1eef. V\u00ec v\u1eady, t\u00ean \"Uy\u00ean T\u1ed1\" l\u00e0 c\u00e1i t\u00ean kh\u00e1 nh\u1eb9 nh\u00e0ng v\u00e0 \u0111\u00e1ng y\u00eau d\u00e0nh cho con g\u00e1i, d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, thanh cao, nhu m\u00ec, m\u1ed9c m\u1ea1c v\u00e0 gi\u1ea3n \u0111\u01a1n", "sex": 5}
{"first_name": "An T\u00f4ng", "meaning": "\"An\" l\u00e0 y\u00ean \u0111\u1ecbnh. \"An T\u00f4ng\" l\u00e0 d\u00f2ng d\u00f5i ch\u00ednh th\u1ed1ng, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi c\u00f3 b\u1ea3n l\u0129nh.", "sex": 3}
{"first_name": "Ho\u00e0ng T\u00f4ng", "meaning": "\"Ho\u00e0ng\" l\u00e0 vua ch\u00faa. \"Ho\u00e0ng T\u00f4ng\" ng\u1ee5 \u00fd con ng\u01b0\u1eddi c\u00f3 g\u1ed1c r\u1ec5 danh gi\u00e1, nh\u00e2n ph\u1ea9m h\u01a1n ng\u01b0\u1eddi.", "sex": 3}
{"first_name": "A T\u1ecbnh", "meaning": "\"T\u1ecbnh\" l\u00e0 y\u00ean t\u0129nh. \"A T\u1ecbnh\" l\u00e0 kh\u1edfi \u0111\u1ea7u y\u00ean t\u0129nh, ch\u1ec9 v\u00e0o s\u1ef1 th\u1eadn tr\u1ecdng, t\u1ed1t \u0111\u1eb9p.", "sex": 7}
{"first_name": "An T\u1ecbnh", "meaning": "T\u00ean An theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 m\u1ed9t c\u00e1i t\u00ean nh\u1eb9 nh\u00e0ng v\u00e0 c\u00f3 \u00fd ngh\u0129a an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3. T\u00ean \"An Ti\u0323nh\" ch\u01b0\u0301a \u0111\u01b0\u0323ng thu\u00e2\u0323n khi\u0301 kh\u00f4ng chi\u0309 \u0111em la\u0323i may m\u0103\u0301n  ma\u0300 co\u0300n \u00e2\u0309n ch\u01b0\u0301a r\u00e2\u0301t nhi\u00ea\u0300u ni\u00ea\u0300m hi vo\u0323ng va\u0300 g\u01b0\u0309i g\u0103\u0301m  cu\u0309a b\u00f4\u0301 me\u0323 \u0111\u0103\u0323t va\u0300o con.", "sex": 3}
{"first_name": "Anh T\u1ecbnh", "meaning": "Ti\u0323nh- t\u01b0\u0323 thanh ti\u0323nh. Anh- t\u01b0\u0301c tinh anh. T\u00ean \"Anh Ti\u0323nh\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd th\u00f4ng minh, hi\u1ec3u bi\u1ebft, c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean, kh\u00f4ng ch\u00fat xao \u0111\u1ed9ng n\u00e0o.", "sex": 3}
{"first_name": "C\u00e1t T\u1ecbnh", "meaning": "\"Ti\u0323nh\" ngh\u0129a l\u00e0 thanh ti\u0323nh. \"C\u00e1t\"  t\u01b0\u0301c c\u00e1t t\u01b0\u1eddng. \"C\u00e1t T\u1ecbnh\" l\u00e0 s\u1ef1 k\u1ebft h\u1ee3p th\u00fa v\u1ecb \u0111\u1ec3 n\u00f3i v\u1ec1 nh\u1eefng ng\u01b0\u1eddi t\u0129nh l\u1eb7ng n\u01a1i t\u00e2m h\u1ed3n, lu\u00f4n hoan h\u1ec9, \u0111\u1ee9c h\u1ea1nh t\u1ed1t.", "sex": 5}
{"first_name": "Chi T\u1ecbnh", "meaning": "\"Ti\u0323nh\" t\u01b0\u0323 thanh ti\u0323nh.  \"Chi\" nghi\u0303a la\u0300 ca\u0300nh, trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i.  L\u00e0 ch\u1eef \"Chi\" trong Kim Chi Ng\u1ecdc Di\u1ec7p \u00fd ch\u1ec9 \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc.\"Chi T\u1ecbnh\" l\u00e0 s\u1ef1 k\u1ebft h\u1ee3p th\u00fa v\u1ecb \u0111\u1ec3 n\u00f3i v\u1ec1 ng\u01b0\u1eddi t\u0129nh l\u1eb7ng n\u01a1i t\u00e2m h\u1ed3n, \u0111\u1ee9c h\u1ea1nh t\u1ed1t.", "sex": 5}
{"first_name": "Di T\u1ecbnh", "meaning": "\"Di\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0  vui v\u1ebb, sung s\u01b0\u1edbng. \"T\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 s\u1ea1ch s\u1ebd, thanh khi\u1ebft. B\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u1ed9ng l\u1eaby, xinh \u0111\u1eb9p, y\u00ean t\u0129nh. V\u00ec v\u1eady \u0111\u1eb7t t\u00ean \"Di T\u1ecbnh\" cho con b\u1ed1 m\u1eb9 hi v\u1ecdng cu\u1ed9c s\u1ed1ng c\u1ee7a con lu\u00f4n \u0111\u1ea7y \u1eafp ni\u1ec1m vui v\u00e0 ti\u1ebfng c\u01b0\u1eddi.", "sex": 3}
{"first_name": "Huy T\u1ecbnh", "meaning": "Trong ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Huy\" c\u00f3 ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng r\u1ef1c r\u1ee1. \"T\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 s\u1ea1ch s\u1ebd, thanh khi\u1ebft. B\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u1ed9ng l\u1eaby, xinh \u0111\u1eb9p, y\u00ean t\u0129nh. T\u00ean \"Huy T\u1ecbnh\" th\u1ec3 hi\u1ec7n s\u1ef1 th\u00f4ng minh, tr\u00ed tu\u1ec7, cho th\u1ea5y s\u1ef1 k\u1ef3 v\u1ecdng v\u00e0o t\u01b0\u01a1ng lai v\u1ebb vang c\u1ee7a con c\u00e1i.", "sex": 3}
{"first_name": "Kh\u00f4i T\u1ecbnh", "meaning": "T\u00ean \"Kh\u00f4i\" c\u0169ng nh\u01b0 t\u00ean \"Khoa\" th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi t\u00e0i n\u0103ng b\u1eadc nh\u1ea5t, l\u00e0 ng\u01b0\u1eddi gi\u1ecfi \u0111\u1ee9ng \u0111\u1ea7u trong s\u1ed1 nh\u1eefng ng\u01b0\u1eddi gi\u1ecfi. \"T\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 s\u1ea1ch s\u1ebd, thanh khi\u1ebft. B\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u1ed9ng l\u1eaby, xinh \u0111\u1eb9p, y\u00ean t\u0129nh. T\u00ean \"Kh\u00f4i T\u1ecbnh\" th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi  tu\u1ea5n t\u00fa, th\u00f4ng minh, gi\u1ecfi giang h\u01a1n ng\u01b0\u1eddi, c\u00f3 cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean, kh\u00f4ng g\u1eb7p s\u00f3ng gi\u00f3", "sex": 3}
{"first_name": "Kh\u01b0\u01a1ng T\u1ecbnh", "meaning": "\"Kh\u01b0\u01a1ng\" th\u1ef1c ch\u1ea5t l\u00e0 t\u1eeb \u0111\u01b0\u1ee3c n\u00f3i tr\u1ea1i ra theo ti\u1ebfng Vi\u1ec7t, v\u00ec v\u1eady \"Kh\u01b0\u01a1ng\" c\u0169ng mang \u00fd ngh\u0129a nh\u01b0 ch\u1ec9 s\u1ef1 y\u00ean \u1ed5n, an b\u00ecnh ho\u1eb7c \u0111\u01b0\u1ee3c d\u00f9ng khi n\u00f3i \u0111\u1ebfn s\u1ef1 gi\u00e0u c\u00f3, \u0111\u1ee7 \u0111\u1ea7y, th\u01b0\u1eddng mang h\u00e0m \u00fd t\u1ed1t \u0111\u1eb9p. \"T\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 s\u1ea1ch s\u1ebd, thanh khi\u1ebft. B\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u1ed9ng l\u1eaby, xinh \u0111\u1eb9p, y\u00ean t\u0129nh. T\u00ean \"Kh\u01b0\u01a1ng T\u1ecbnh\" ch\u1ec9 ng\u01b0\u1eddi kh\u1ecfe m\u1ea1nh, ph\u00fa qu\u00fd & mong \u01b0\u1edbc cu\u1ed9c s\u1ed1ng b\u00ecnh an.", "sex": 3}
{"first_name": "L\u00e2m T\u1ecbnh", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"L\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 r\u1eebng, m\u1ed9t ngu\u1ed3n t\u00e0i nguy\u00ean qu\u00fd c\u00f3 gi\u00e1 tr\u1ecb to l\u1edbn v\u1edbi \u0111\u1eddi s\u1ed1ng. \"T\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 s\u1ea1ch s\u1ebd, thanh khi\u1ebft. B\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u1ed9ng l\u1eaby, xinh \u0111\u1eb9p, y\u00ean t\u0129nh. \"L\u00e2m T\u1ecbnh\" g\u1ee3i \u0111\u1ebfn h\u00ecnh \u1ea3nh r\u1eebng n\u00fai b\u1ea1t ng\u00e0n, h\u00f9ng v\u0129 nh\u01b0ng y\u00ean b\u00ecnh. T\u00ean \"L\u00e2m T\u1ecbnh\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi b\u00ecnh d\u1ecb, d\u1ec5 g\u1ea7n nh\u01b0 l\u1ebd t\u1ef1 nhi\u00ean nh\u01b0ng c\u0169ng m\u1ea1nh m\u1ebd & \u0111\u1ea7y uy l\u1ef1c", "sex": 3}
{"first_name": "Nhi T\u1ecbnh", "meaning": "\"Nhi T\u1ecbnh\" ngh\u0129a l\u00e0 con hi\u1ec1n l\u00e0nh, t\u00e2m h\u1ed3n nh\u00e2n h\u1eadu thanh khi\u1ebft.", "sex": 5}
{"first_name": "Quang T\u1ecbnh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, Quang c\u00f3 ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, \"T\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 s\u1ea1ch s\u1ebd, thanh khi\u1ebft. B\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u1ed9ng l\u1eaby, xinh \u0111\u1eb9p, y\u00ean t\u0129nh. T\u00ean \"Quang T\u1ecbnh\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, s\u00e1ng su\u1ed1t, c\u00f3 t\u00e0i n\u0103ng, c\u00f3 t\u00e2m h\u1ed3n thanh t\u1ecbnh, c\u00f3 l\u1eadp tr\u01b0\u1eddng, kh\u00f4ng b\u1ecb c\u00e1m d\u1ed7", "sex": 3}
{"first_name": "Sam T\u1ecbnh", "meaning": "Theo ngh\u0129a ti\u1ebfng H\u00e1n, \"T\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 s\u1ea1ch s\u1ebd, thanh khi\u1ebft. B\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u1ed9ng l\u1eaby, xinh \u0111\u1eb9p, y\u00ean t\u0129nh. Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Sam\" c\u00f3 ngh\u0129a l\u00e0 s\u1eafc, b\u00e9n, nh\u1ecdn.  Ngo\u00e0i ra \"Sam\" c\u00f2n l\u00e0 t\u00ean m\u1ed9t lo\u00e0i \u0111\u1ed9ng v\u1eadt ch\u00e2n \u0111\u1ed1t \u1edf bi\u1ec3n t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 th\u1ee7y chung, son s\u1eafc, s\u1ed1ng c\u00f3 t\u00ecnh c\u00f3 ngh\u0129a. Ng\u01b0\u1eddi t\u00ean \"Sam T\u1ecbnh\" th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh, s\u1eafc s\u1ea3o, s\u1ed1ng kh\u00f4n kh\u00e9o, hi\u1ec3u bi\u1ebft, c\u00f3 dung m\u1ea1o thanh tao, qu\u00fd ph\u00e1i, c\u00f3 cu\u1ed9c s\u1ed1ng an nh\u00e0n, thanh cao.", "sex": 3}
{"first_name": "S\u01a1n T\u1ecbnh", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t, \"S\u01a1n\" l\u00e0 n\u00fai, t\u00ednh ch\u1ea5t c\u1ee7a n\u00fai l\u00e0 lu\u00f4n v\u1eefng ch\u00e3i, h\u00f9ng d\u0169ng v\u00e0 tr\u1ea7m t\u0129nh. \"T\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 s\u1ea1ch s\u1ebd, thanh khi\u1ebft. B\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u1ed9ng l\u1eaby, xinh \u0111\u1eb9p, y\u00ean t\u0129nh. T\u00ean \"S\u01a1n T\u1ecbnh\" n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi m\u1ea1nh m\u1ebd, ki\u00ean c\u01b0\u1eddng, kh\u00ed ch\u1ea5t \u0111i\u1ec1m \u0111\u1ea1m, b\u00ecnh d\u1ecb", "sex": 3}
{"first_name": "Thanh T\u1ecbnh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thanh T\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 y\u00ean \u1eafng, kh\u00f4ng ch\u00fat xao \u0111\u1ed9ng n\u00e0o. V\u00ec v\u1eady, t\u00ean \"Thanh T\u1ecbnh\" l\u00e0 mong mu\u1ed1n cu\u1ed9c s\u1ed1ng c\u1ee7a con \u0111\u01b0\u1ee3c thu\u1eadn l\u1ee3i, b\u00ecnh an, g\u1eb7p nhi\u1ec1u may m\u1eafn, b\u00ean c\u1ea1nh \u0111\u00f3 con c\u00f2n c\u00f3 ngh\u1ecb l\u1ee5c, gi\u1eef v\u1eefng l\u1eadp tr\u01b0\u1eddng, kh\u00f4ng b\u1ecb c\u00e1m d\u1ed7 v\u00e0 \u0111\u1ee9ng l\u00ean sau v\u1ea5p ng\u00e3", "sex": 3}
{"first_name": "Uy T\u1ecbnh", "meaning": "Theo ngh\u0129a ti\u1ebfng H\u00e1n, \"T\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 s\u1ea1ch s\u1ebd, thanh khi\u1ebft. B\u00ean c\u1ea1nh \u0111\u00f3 c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u1ed9ng l\u1eaby, xinh \u0111\u1eb9p, y\u00ean t\u0129nh. \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd.  Theo ngh\u0129a \u0111\u00f3, t\u00ean \"Uy T\u1ecbnh\" \u0111\u01b0\u1ee3c \u0111\u1eb7t nh\u1eb1m mong mu\u1ed1n con c\u00f3 dung m\u1ea1o thanh tao, qu\u00fd ph\u00e1i, c\u00f3 cu\u1ed9c s\u1ed1ng an nh\u00e0n, thanh cao .", "sex": 3}
{"first_name": "Uy\u00ean T\u1ecbnh", "meaning": "\"Ti\u0323nh\" ngh\u0129a l\u00e0 thanh ti\u0323nh.  \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \"Uy\u00ean T\u1ecbnh\" l\u00e0 m\u1ed9t t\u00ean hay d\u00e0nh cho con v\u1edbi \u00fd ngh\u0129a con s\u1ebd l\u00e0 ng\u01b0\u1eddi con g\u00e1i d\u1ecbu d\u00e0ng, t\u00e2m t\u01b0 t\u0129nh l\u1eb7ng.", "sex": 5}
{"first_name": "Uy\u1ec3n T\u1ecbnh", "meaning": "Ti\u0323nh c\u00f3 ngh\u0129a l\u00e0 thanh ti\u0323nh. \"Uy\u1ec3n\" \u00fd ch\u1ec9 s\u1ef1 nh\u1eb9 nh\u00e0ng, kh\u00fac chi\u1ebft uy\u1ec3n chuy\u1ec3n th\u1ec3 hi\u1ec7n s\u1ef1 thanh tao tinh t\u1ebf c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \"Uy\u1ec3n T\u1ecbnh\" l\u00e0 t\u00ean hay th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t cho b\u00e9 g\u00e1i v\u1edbi mong mu\u1ed1n con s\u1ebd s\u1edf h\u1eefu v\u1ebb ngo\u00e0i xinh \u0111\u1eb9p, d\u1ecbu hi\u1ec1n v\u00e0 t\u00ednh t\u00ecnh tr\u1ea7m t\u0129nh.", "sex": 5}
{"first_name": "C\u00f4ng Tr\u00e1c", "meaning": "\"C\u00f4ng\" l\u00e0 c\u00e1i chung. \"C\u00f4ng Tr\u00e1c\" l\u00e0 n\u1ed7 l\u1ef1c m\u00e0i gi\u0169a v\u00ec c\u00e1i chung, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi nhi\u1ec7t huy\u1ebft, quy\u1ebft li\u1ec7t, c\u00f3 tr\u00e1ch nhi\u1ec7m c\u1ed9ng \u0111\u1ed3ng.", "sex": 3}
{"first_name": "H\u1eefu Tr\u00e1c", "meaning": "\"H\u1eefu\" l\u00e0 \u0111i\u1ec1u ph\u1ea3i. \"H\u1eefu Tr\u00e1c\" l\u00e0 m\u00e0i gi\u0169a \u0111i\u1ec1u ph\u1ea3i, ch\u1ec9 v\u00e0o con ng\u01b0\u1eddi c\u00f4ng minh ch\u00ednh tr\u1ef1c, h\u00e0nh \u0111\u1ed9ng l\u1ed7i l\u1ea1c \u0111\u01b0\u1eddng ho\u00e0ng.", "sex": 3}
{"first_name": "\u0110\u00ecnh T\u1ed1t", "meaning": "\"\u0110\u00ecnh\" l\u00e0 n\u01a1i quan vi\u00ean l\u00e0m vi\u1ec7c. \"\u0110\u00ecnh T\u1ed1t\" l\u00e0 ho\u00e0n t\u1ea5t \u0111\u01b0\u1ee3c vi\u1ec7c quan tr\u01b0\u1eddng, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi m\u1eabn c\u00e1n t\u1eadn t\u1ee5y, n\u0103ng l\u1ef1c h\u01a1n ng\u01b0\u1eddi.", "sex": 3}
{"first_name": "Giang Tr\u00e0", "meaning": "\"Tr\u00e0\" l\u00e0 l\u00ean m\u1ed9t lo\u1ea1i th\u1ef1c v\u1eadt, g\u1ea7n g\u0169i v\u1edbi con ng\u01b0\u1eddi, mang \u00fd ngh\u0129a tao nh\u00e3, thanh tao. \"Giang\" l\u00e0 d\u00f2ng s\u00f4ng, th\u01b0\u1eddng ch\u1ec9 nh\u1eefng \u0111i\u1ec1u cao c\u1ea3, l\u1edbn lao. T\u00ean \"Giang Tr\u00e0\" g\u1ee3i s\u1ef1 d\u1ecbu d\u00e0ng, nh\u1eb9 nh\u00e0ng v\u00e0 thanh b\u00ecnh, mong mu\u1ed1n con g\u00e1i lu\u00f4n gi\u1eef c\u1ed1t c\u00e1ch thanh cao, d\u1ecbu d\u00e0ng v\u00e0 \u0111\u1eb1m th\u1eafm.", "sex": 5}
{"first_name": "H\u1ea1nh Tr\u00e0", "meaning": "Theo H\u00e1n - Vi\u1ec7t, t\u00ean \"H\u1ea1nh\" th\u1ee9 nh\u1ea5t, c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 ph\u00fac l\u1ed9c, l\u00e0 ph\u01b0\u1edbc l\u00e0nh. Ngh\u0129a th\u1ee9 hai l\u00e0 n\u00f3i v\u1ec1 m\u1eb7t \u0111\u1ea1o \u0111\u1ee9c, t\u00ednh n\u1ebft c\u1ee7a con ng\u01b0\u1eddi. T\u00ean \"H\u1ea1nh Tr\u00e0\" th\u01b0\u1eddng d\u00f9ng cho n\u1eef, ch\u1ec9 ng\u01b0\u1eddi n\u1ebft na, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, \u0111\u00f4n h\u1eadu, ph\u1ea9m ch\u1ea5t cao \u0111\u1eb9p.", "sex": 5}
{"first_name": "H\u01b0\u01a1ng Tr\u00e0", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"H\u01b0\u01a1ng\"  ch\u1ec9 m\u00f9i h\u01b0\u01a1ng th\u01a1m. \"H\u01b0\u01a1ng Tr\u00e0\"  g\u1ee3i \u0111\u1ebfn m\u00f9i h\u01b0\u01a1ng th\u01a1m ng\u00e1t c\u1ee7a hoa tr\u00e0, t\u1ea1o c\u1ea3m gi\u00e1c tho\u1ea3i m\u00e1i, tinh th\u1ea7n t\u01b0\u01a1i t\u1ec9nh. T\u00ean \"H\u01b0\u01a1ng Tr\u00e0\"  th\u1ec3 hi\u1ec7n \u0111\u01b0\u1ee3c s\u1ef1 d\u1ecbu d\u00e0ng, quy\u1ebfn r\u0169, thanh cao v\u00e0 \u0111\u1eb1m th\u1eafm c\u1ee7a ng\u01b0\u1eddi con g\u00e1i", "sex": 5}
{"first_name": "Mi Tr\u00e0", "meaning": "\"Mi Tr\u00e0\" l\u00e0 m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p.", "sex": 5}
