{"first_name": "Ng\u00e2n Tr\u00e0", "meaning": "Ng\u00e2n theo ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ti\u1ec1n. Th\u1ec3 hi\u1ec7n s\u1ef1 qu\u00fd b\u00e1u. T\u00ean Ng\u00e2n Tr\u00e0 mang \u00fd ngh\u0129a xinh \u0111\u1eb9p, duy\u00ean d\u00e1ng, b\u00ecnh d\u1ecb, c\u00f2n c\u00f3 th\u1ec3 hi\u1ec3u l\u00e0 cha m\u1eb9 mong mu\u1ed1n t\u01b0\u01a1ng lai con lu\u00f4n \u0111\u01b0\u1ee3c \u0111\u1ee7 \u0111\u1ea7y, sung s\u01b0\u1edbng, con s\u1ebd l\u00e0 ng\u01b0\u1eddi c\u00f3 \u00edch", "sex": 5}
{"first_name": "Nh\u01b0 Tr\u00e0", "meaning": "Nh\u01b0 trong ti\u1ebfng Vi\u1ec7t l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 so s\u00e1nh. T\u00ean \"Nh\u01b0 Tr\u00e0\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi \u00fd ngh\u0129a mong con xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng nh\u01b0 h\u01b0\u01a1ng nh\u01b0 hoa tr\u00e0, lu\u00f4n vui t\u01b0\u01a1i, m\u1ea1nh m\u1ebd, kh\u00f4ng v\u1ea5p ng\u00e3 tr\u01b0\u1edbc kh\u00f3 kh\u0103n", "sex": 5}
{"first_name": "Ph\u01b0\u01a1ng Tr\u00e0", "meaning": "Ch\u1eef  \"Ph\u01b0\u01a1ng\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t ngh\u0129a l\u00e0 h\u01b0\u1edbng, v\u1ecb tr\u00ed, \u0111\u1ea1o l\u00fd. T\u00ean \"Ph\u01b0\u01a1ng\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi bi\u1ebft \u0111\u1ea1o l\u00fd l\u00e0m ng\u01b0\u1eddi, bi\u1ebft ph\u00e2n bi\u1ec7t t\u1ed1t x\u1ea5u, \u0111\u00fang sai. Th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi s\u00e1ng su\u1ed1t, tr\u00ed tu\u1ec7. T\u00ean  \"Ph\u01b0\u01a1ng\" l\u00e0 mong mu\u1ed1n c\u1ee7a cha m\u1eb9 mu\u1ed1n con m\u00ecnh lu\u00f4n l\u00e0m nh\u1eefng \u0111i\u1ec1u t\u1ed1t, bi\u1ebft c\u00e1ch \u0111\u1ed1i nh\u00e2n x\u1eed th\u1ebf, l\u00e0m cha m\u1eb9 y\u00ean l\u00f2ng", "sex": 5}
{"first_name": "S\u01a1n Tr\u00e0", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t, \"S\u01a1n\" l\u00e0 n\u00fai, t\u00ednh ch\u1ea5t c\u1ee7a n\u00fai l\u00e0 lu\u00f4n v\u1eefng ch\u00e3i, h\u00f9ng d\u0169ng v\u00e0 tr\u1ea7m t\u0129nh. V\u00ec v\u1eady t\u00ean \"s\u01a1n\" g\u1ee3i c\u1ea3m gi\u00e1c oai nghi, b\u1ea3n l\u0129nh, c\u00f3 th\u1ec3 l\u00e0 ch\u1ed7 d\u1ef1a v\u1eefng ch\u1eafc an to\u00e0n.", "sex": 5}
{"first_name": "Thanh Tr\u00e0", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 m\u00e0u xanh, tu\u1ed5i tr\u1ebb, c\u00f2n l\u00e0 s\u1ef1 thanh cao, trong s\u1ea1ch, thanh b\u1ea1ch. \"Thanh Tr\u00e0\" \u00fd ch\u1ec9 nh\u1eefng b\u00fap tr\u00e0 non, t\u01b0\u01a1i xanh, m\u00e1t r\u01b0\u1ee3i. Ng\u01b0\u1eddi t\u00ean \"Thanh Tr\u00e0\" th\u01b0\u1eddng c\u00f3 kh\u00ed ch\u1ea5t \u0111i\u1ec1m \u0111\u1ea1m, nh\u1eb9 nh\u00e0ng v\u00e0 cao qu\u00fd, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean", "sex": 5}
{"first_name": "Th\u00fay Tr\u00e0", "meaning": "\"S\u01a1n Tr\u00e0\" m\u1ed9t th\u1ee9 c\u00e2y l\u00e1 th\u01b0\u1eddng xanh, hoa tr\u1eafng, c\u00f3 th\u1ee9 \u0111\u1ecf, d\u00f9ng l\u00e0m c\u1ea3nh ch\u01a1i. Ng\u01b0\u1eddi t\u00ean \"S\u01a1n Tr\u00e0\" th\u01b0\u1eddng c\u00f3 c\u1ed1t c\u00e1ch cao qu\u00fd, sang tr\u1ecdng. Cha m\u1eb9 mong con c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng an nh\u00e0n, thanh cao", "sex": 5}
{"first_name": "Uy\u1ec3n Tr\u00e0", "meaning": "\"Tr\u00e0\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean g\u1ee3i \u0111\u1ebfn s\u1ef1 g\u1ea7n g\u0169i, th\u00e2n y\u00eau. \"Uy\u1ec3n\" mang \u00fd ch\u1ec9 s\u1ef1 nh\u1eb9 nh\u00e0ng, kh\u00fac chi\u1ebft uy\u1ec3n chuy\u1ec3n th\u1ec3 hi\u1ec7n s\u1ef1 thanh tao tinh t\u1ebf c\u1ee7a ng\u01b0\u1eddi con g\u00e1i. \"Uy\u1ec3n Tr\u00e0\" l\u00e0 t\u00ean hay cho con. Ba m\u1eb9 mong con xinh \u0111\u1eb9p, m\u1ed9c m\u1ea1c, c\u00f3 s\u1ee9c s\u1ed1ng m\u1ea1nh m\u1ebd, l\u00e0m \u0111\u01b0\u1ee3c nhi\u1ec1u vi\u1ec7c c\u00f3 \u00edch, gi\u00fap ng\u01b0\u1eddi, gi\u00fap \u0111\u1eddi.", "sex": 5}
{"first_name": "V\u00e2n Tr\u00e0", "meaning": "V\u00e2n theo ngh\u0129a H\u00e1n vi\u1ec7t l\u00e0 m\u00e2y, g\u1ee3i c\u1ea3m gi\u00e1c nh\u1eb9 nh\u00e0ng nh\u01b0 \u0111\u00e1m m\u00e2y tr\u1eafng b\u1ed3ng b\u1ec1nh tr\u00ean tr\u1eddi. Trong m\u1ed9t s\u1ed1 t\u00e1c ph\u1ea9m v\u0103n h\u1ecdc th\u01b0\u1eddng d\u00f9ng V\u00e2n l\u00e0 kh\u00f3i \u2013 l\u1ea5y V\u00e2n \u0111\u1ec3 h\u00ecnh dung ra m\u1ed9t m\u1ef9 c\u1ea3nh thi\u00ean nhi\u00ean t\u01b0\u01a1i \u0111\u1eb9p. T\u00ean V\u00e2n Tr\u00e0 g\u1ee3i \u0111\u1ebfn c\u1ea3nh v\u1eadt thi\u00ean nhi\u00ean t\u01b0\u01a1i \u0111\u1eb9p, n\u00ean th\u01a1, m\u1ea5y tr\u1eafng tr\u00f4i b\u1ec1nh b\u1ed3ng tr\u00ean c\u00e1nh \u0111\u1ed3ng tr\u00e0 xanh ng\u00e1t. T\u00ean \"V\u00e2n Tr\u00e0\" th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi xinh \u0111\u1eb9p, duy d\u00e1ng, c\u00f3 cu\u1ed9c s\u1ed1ng an nh\u00e0n, b\u00ecnh y\u00ean", "sex": 5}
{"first_name": "Xuy\u00ean Tr\u00e0", "meaning": "\"Tr\u00e0\" l\u00e0 t\u00ean m\u1ed9t lo\u1ea1i c\u00e2y xanh. \"Xuy\u00ean Tr\u00e0\", con l\u00e0 h\u01b0\u01a1ng v\u1ecb \u0111\u1eb7c bi\u1ec7t c\u1ee7a thi\u00ean nhi\u00ean ban t\u1eb7ng cho cu\u1ed9c s\u1ed1ng.", "sex": 5}
{"first_name": "Xuy\u1ebfn Tr\u00e0", "meaning": "\"Tr\u00e0\" l\u00e0 lo\u1ea1i c\u00e2y xanh l\u01b0u ni\u00ean m\u1ecdc th\u00e0nh b\u1ee5i ho\u1eb7c c\u00e1c c\u00e2y nh\u1ecf, \u0111\u01b0\u1ee3c tr\u1ed3ng \u0111\u1ec3 l\u1ea5y l\u00e1. N\u00f3 c\u00f3 r\u1ec5 c\u00e1i d\u00e0i. Hoa m\u00e0u tr\u1eafng \u00e1nh v\u00e0ng v\u1edbi 7 - 8 c\u00e1nh hoa. H\u1ea1t c\u1ee7a n\u00f3 c\u00f3 th\u1ec3 \u00e9p \u0111\u1ec3 l\u1ea5y d\u1ea7u. \"Tr\u00e0\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean g\u1ee3i \u0111\u1ebfn s\u1ef1 g\u1ea7n g\u0169i, th\u00e2n y\u00eau. \"Xuy\u1ebfn\" l\u00e0 m\u00f3n trang s\u1ee9c qu\u00fd gi\u00e1. T\u00ean \"Xuy\u1ebfn Tr\u00e0\" mang \u00fd ngh\u0129a con l\u00e0 b\u1ea3o v\u1eadt qu\u00fd c\u1ee7a gia \u0111\u00ecnh, cha m\u1eb9 mong con xinh \u0111\u1eb9p, m\u1ed9c m\u1ea1c, c\u00f3 s\u1ee9c s\u1ed1ng m\u1ea1nh m\u1ebd, l\u00e0m \u0111\u01b0\u1ee3c nhi\u1ec1u vi\u1ec7c c\u00f3 \u00edch, gi\u00fap ng\u01b0\u1eddi, gi\u00fap \u0111\u1eddi.", "sex": 5}
{"first_name": "Y\u00ean Tr\u00e0", "meaning": "\"Tr\u00e0\" g\u1ee3i \u0111\u1ebfn s\u1ef1 g\u1ea7n g\u0169i, th\u00e2n y\u00eau. \"Y\u00ean Tr\u00e0\", con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p hi\u1ec1n h\u00f2a d\u1ec5 g\u1ea7n,cu\u1ed9c s\u1ed1ng c\u1ee7a con nh\u1eb9 nh\u00e0ng lu\u00f4n g\u1eb7p \u0111\u01b0\u1ee3c nhi\u1ec1u \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p v\u00e0 b\u00ecnh y\u00ean trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
{"first_name": "Y\u1ebfn Tr\u00e0", "meaning": "Theo ngh\u0129a  H\u00e1n-Vi\u1ec7t  \"Ph\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 h\u01b0\u01a1ng th\u01a1m c\u1ee7a hoa c\u1ecf. \"Ph\u01b0\u01a1ng Tr\u00e0\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 \u0111\u1ebfn h\u01b0\u01a1ng th\u01a1m c\u1ee7a hoa tr\u00e0 quy\u1ec7n v\u1edbi m\u00e0u xanh bi\u1ebfc c\u1ee7a c\u1ea3 c\u00e1nh \u0111\u1ed3ng tr\u00e0 r\u1ea5t \u0111\u1eb9p, g\u1ee3i c\u1ea3m gi\u00e1c tho\u1ea3i m\u00e1i, thanh m\u00e1t d\u1ec5 ch\u1ecbu cho ng\u01b0\u1eddi nh\u00ecn ng\u1eafm ch\u00fang. T\u00ean \"Ph\u01b0\u01a1ng Tr\u00e0\" th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p, t\u00e2m h\u1ed3n trong s\u00e1ng v\u00e0 c\u00f3 s\u1ee9c s\u1ed1ng m\u00e3nh li\u1ec7t, y\u00eau \u0111\u1eddi t\u1ef1a nh\u01b0 lo\u00e0i hoa d\u1ea1i", "sex": 5}
{"first_name": "B\u00e1 T\u1ed5ng", "meaning": "\"B\u00e1\" l\u00e0 to l\u1edbn. \"B\u00e1 T\u1ed5ng\" l\u00e0 t\u1eadp h\u1ee3p quy m\u00f4, ch\u1ec9 con ng\u01b0\u1eddi c\u00f3 t\u00e0i c\u00e1n th\u1ef1c l\u1ef1c, lo li\u1ec7u m\u1ecdi s\u1ef1 chu to\u00e0n.", "sex": 3}
{"first_name": "H\u1eefu Tr\u1ea1ch", "meaning": "H\u1eefu l\u00e0 \u0111i\u1ec1u ph\u1ea3i. H\u1eefu Tr\u1ea1ch l\u00e0 ch\u1ecdn theo \u0111i\u1ec1u ph\u1ea3i, h\u00e0m \u00fd ng\u01b0\u1eddi ch\u00ednh ngh\u0129a t\u1ecf t\u01b0\u1eddng, ph\u1ea9m ch\u1ea5t cao qu\u00fd", "sex": 3}
{"first_name": "\u00c1i Thy", "meaning": "T\u00ean \"\u00c1i\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 y\u00eau, ch\u1ec9 v\u1ec1 ng\u01b0\u1eddi c\u00f3 t\u1ea5m l\u00f2ng l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, chan h\u00f2a.  A\u0301i Thy l\u00e0 m\u1ed9t c\u00e1i t\u00ean nh\u1eb9 nh\u00e0ng, \u0111\u01b0\u1ee3c g\u1eedi g\u1eafm v\u1edbi \u00fd ngh\u0129a v\u1ec1 m\u1ed9t cu\u1ed9c s\u1ed1ng thanh tao c\u1ee7a m\u1ed9t con ng\u01b0\u1eddi th\u00f4ng minh t\u00e0i gi\u1ecfi \u0111\u01b0\u01a1\u0323c nhi\u00ea\u0300u ng\u01b0\u01a1\u0300i y\u00eau m\u00ea\u0301n.", "sex": 5}
{"first_name": "An Thy", "meaning": "\"An\" l\u00e0 b\u00ecnh y\u00ean. \"An Thy\" l\u00e0 b\u00e0i th\u01a1 t\u0129nh t\u1ea1i, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi c\u00f3 t\u00e2m h\u1ed3n ngh\u1ec7 s\u0129.", "sex": 5}
{"first_name": "Anh Thy", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Anh\" ngh\u0129a l\u00e0 th\u00f4ng minh, t\u00e0i gi\u1ecfi h\u01a1n ng\u01b0\u1eddi. \"Anh Thy\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean nh\u1eb9 nh\u00e0ng, tao nh\u00e3, c\u00e1i t\u00ean \u0111\u01b0\u1ee3c g\u1eedi g\u1eafm nh\u1eefng \u01b0\u1edbc m\u01a1 t\u01b0\u01a1i \u0111\u1eb9p v\u1ec1 m\u1ed9t cu\u1ed9c s\u1ed1ng thanh tao, h\u1ea1nh ph\u00fac c\u1ee7a m\u1ed9t con ng\u01b0\u1eddi th\u00f4ng minh, t\u00e0i gi\u1ecfi; l\u00e0 mong mu\u1ed1n t\u01b0\u01a1ng lai b\u00e9 s\u1ebd l\u00e0m cho gia \u0111\u00ecnh, d\u00f2ng t\u1ed9c ng\u00e0y c\u00e0ng th\u1ecbnh v\u01b0\u1ee3ng, gi\u00e0u c\u00f3.", "sex": 5}
{"first_name": "B\u1ea3o Thy", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"B\u1ea3o\" c\u00f3 ngh\u0129a l\u00e0 b\u1ea3o b\u1ed1i, b\u1ea3o v\u1eadt, ch\u1ec9 nh\u1eefng \u0111\u1ed3 v\u1eadt c\u00f3 gi\u00e1 tr\u1ecb v\u00e0 qu\u00fd hi\u1ebfm. \"B\u1ea3o Thy\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t nh\u1eb1m g\u1edfi g\u1eafm nh\u1eefng \u0111i\u1ec1u \u01b0\u1edbc t\u1ed1t \u0111\u1eb9p nh\u1ea5t \u0111\u1ebfn con y\u00eau, mong con xinh \u0111\u1eb9p, g\u1eb7p nhi\u1ec1u may m\u1eafn v\u00e0 \u0111\u01b0\u1ee3c y\u00eau th\u01b0\u01a1ng, n\u00e2ng niu .", "sex": 5}
{"first_name": "H\u1ea1nh Thy", "meaning": "Theo H\u00e1n - Vi\u1ec7t, \"H\u1ea1nh\" th\u1ee9 nh\u1ea5t, c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 ph\u00fac l\u1ed9c, l\u00e0 ph\u01b0\u1edbc l\u00e0nh. Ngh\u0129a th\u1ee9 hai l\u00e0 n\u00f3i v\u1ec1 m\u1eb7t \u0111\u1ea1o \u0111\u1ee9c, t\u00ednh n\u1ebft c\u1ee7a con ng\u01b0\u1eddi. T\u00ean \"H\u1ea1nh Thy\" ch\u1ec9 ng\u01b0\u1eddi xinh \u0111\u1eb9p, th\u00f4ng minh, d\u1ecbu d\u00e0ng, n\u1ebft na, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, ph\u1ea9m ch\u1ea5t cao \u0111\u1eb9p", "sex": 5}
{"first_name": "Loan Thy", "meaning": "Loan l\u00e0 chim ph\u01b0\u1ee3ng m\u00e1i linh thi\u00eang, cao qu\u00fd, Thy c\u00f3 ngh\u0129a l\u00e0 th\u01a1, mang \u00fd m\u1ec1m m\u1ea1i, nh\u1eb9 nh\u00e0ng, c\u00f3 h\u1ecdc th\u1ee9c. Loan Thy c\u00f3 ngh\u0129a con th\u00f4ng minh, xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, c\u00f3 h\u1ecdc th\u1ee9c & c\u1ed1t c\u00e1ch cao sang, qu\u00fd ph\u00e1i", "sex": 5}
{"first_name": "Mai Thy", "meaning": "Theo t\u1eeb \u0111i\u1ec3n Ti\u1ebfng Vi\u1ec7t, \"Mai\" l\u00e0 t\u00ean g\u1ecdi c\u1ee7a m\u1ed9t lo\u1ea1i hoa \u0111\u1eb9p th\u01b0\u1eddng n\u1edf hoa m\u1ed7i \u0111\u1ed9 xu\u00e2n v\u1ec1. \"Mai Thy\" l\u00e0 c\u00e1i t\u00ean to\u00e1t l\u00ean \u0111\u01b0\u1ee3c v\u1ebb thanh tao, duy\u00ean d\u00e1ng c\u1ee7a m\u1ed9t ng\u01b0\u1eddi con g\u00e1i nh\u1eb9 nh\u00e0ng xu\u00e2n s\u1eafc, nh\u01b0 c\u00e1nh hoa mai t\u01b0\u01a1i \u0111e\u0323p.", "sex": 5}
{"first_name": "Nguy\u1ec7t Thy", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, nguy\u1ec7t l\u00e0 v\u1ea7ng tr\u0103ng, Tr\u0103ng c\u00f3 v\u1ebb \u0111\u1eb9p v\u00f4 c\u00f9ng b\u00ecnh d\u1ecb, m\u1ed9t v\u1ebb \u0111\u1eb9p kh\u00f4ng c\u1ea7n trang s\u1ee9c, \u0111\u1eb9p m\u1ed9t c\u00e1ch v\u00f4 t\u01b0, h\u1ed3n nhi\u00ean. Tr\u0103ng t\u01b0\u1ee3ng tr\u01b0ng cho v\u1ebb \u0111\u1eb9p h\u1ed3n nhi\u00ean n\u00ean tr\u0103ng ho\u00e0 v\u00e0o thi\u00ean nhi\u00ean, ho\u00e0 v\u00e0o c\u00e2y c\u1ecf. T\u00ean Nguy\u1ec7t Thy g\u1ee3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, c\u00f4ng dung ng\u00f4n h\u1ea1nh, gi\u1ea3n d\u1ecb, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean", "sex": 5}
{"first_name": "Ph\u1ee5ng Thy", "meaning": "\"Thy\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 th\u01a1, d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng g\u00ec m\u1ec1m m\u1ea1i, nh\u1eb9 nh\u00e0ng. \"Ph\u1ee5ng Thy\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con g\u00e1i s\u1ebd xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, c\u00f4ng dung ng\u00f4n h\u1ea1nh, c\u00f3 cu\u1ed9c s\u1ed1ng quy\u1ec1n qu\u00fd, gi\u00e0u sang.", "sex": 5}
{"first_name": "T\u1ecbnh Thy", "meaning": "\"T\u1ecbnh\" l\u00e0 y\u00ean t\u0129nh. \"T\u1ecbnh Thy\" l\u00e0 b\u00e0i th\u01a1 s\u00e2u l\u1eafng, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi ngh\u1ec7 s\u0129 k\u00edn \u0111\u00e1o.", "sex": 5}
{"first_name": "Uy\u00ean Thy", "meaning": "\"Thy\" l\u00e0 ki\u1ec3u vi\u1ebft kh\u00e1c c\u1ee7a \"Thi\", hi\u1ec7n nay v\u1edbi t\u00ean ri\u00eang m\u1ecdi ng\u01b0\u1eddi hay s\u1eed d\u1ee5ng \"Thy\" h\u01a1n l\u00e0 \"Thi\", \u0111\u1ea5y l\u00e0 theo quan \u0111i\u1ec3m c\u1ee7a Nh\u1eadt th\u00ec t\u00ean c\u00f3 v\u1ea7n \"y\" s\u1ebd mang nhi\u1ec1u may m\u1eafn v\u00e0 h\u1ea1nh ph\u00fac h\u01a1n \"i\", theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 th\u01a1, d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng g\u00ec m\u1ec1m m\u1ea1i, nh\u1eb9 nh\u00e0ng. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i. \"Uy\u00ean Thy\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con g\u00e1i s\u1ebd xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, c\u00f4ng dung ng\u00f4n h\u1ea1nh.", "sex": 5}
{"first_name": "Uy\u1ec3n Thy", "meaning": "\"Thy\" l\u00e0 ki\u1ec3u vi\u1ebft kh\u00e1c c\u1ee7a \"Thi\", d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng g\u00ec m\u1ec1m m\u1ea1i, nh\u1eb9 nh\u00e0ng. \"Uy\u1ec3n Thy\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con g\u00e1i s\u1ebd xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, c\u00f4ng dung ng\u00f4n h\u1ea1nh.", "sex": 5}
{"first_name": "Y\u1ebfn Thy", "meaning": "\"Thy\" hay \"Thi\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 th\u01a1, d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng g\u00ec m\u1ec1m m\u1ea1i, nh\u1eb9 nh\u00e0ng. \"Thy\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con g\u00e1i s\u1ebd xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, c\u00f4ng dung ng\u00f4n h\u1ea1nh. \"Y\u1ebfn Thy\" mang \u00fd ngh\u0129a con  l\u00e0 con chim y\u1ebfn xinh \u0111\u1eb9p, t\u00e0i gi\u1ecfi, c\u1ea7m k\u00ec thi h\u1ecda, c\u00f4ng dung ng\u00f4n h\u1ea1nh.", "sex": 5}
{"first_name": "Ng\u1ecdc Trai", "meaning": "\"Ng\u1ecdc Trai\" l\u00e0 \u0111\u00e1 qu\u00fd, ch\u1ec9 ng\u01b0\u1eddi c\u00f3 ph\u1ea9m ch\u1ea5t cao qu\u00fd m\u00e0 k\u00edn \u0111\u00e1o.", "sex": 3}
{"first_name": "Thanh Tr\u00e0m", "meaning": "\"Thanh\" l\u00e0 m\u00e0u xanh. \"Thanh Tr\u00e0m\" l\u00e0 c\u00e2y tr\u00e0m m\u00e0u xanh, ng\u1ee5 \u00fd con ng\u01b0\u1eddi nhi\u1ec7t t\u00ecnh \u0111\u1ea7y s\u1ee9c s\u1ed1ng.", "sex": 3}
{"first_name": "Minh Tr\u1ea1i", "meaning": "\"Minh Tr\u1ea1i\" ngh\u0129a l\u00e0 tranh \u0111ua quy\u1ebft li\u1ec7t, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi lu\u00f4n n\u1ed7 l\u1ef1c, nh\u1eadn th\u1ee9c nghi\u00eam t\u00fac, ki\u00ean \u0111\u1ecbnh \u0111\u1ebfn c\u00f9ng.", "sex": 3}
{"first_name": "B\u1ea3o Tr\u00e2m", "meaning": "C\u00e2y tr\u00e2m qu\u00fd. Con l\u00e0 b\u1ea3o b\u1ed1i \u0111\u1ed1i v\u1edbi ba m\u1eb9, xinh \u0111\u1eb9p v\u00e0 thanh cao", "sex": 5}
{"first_name": "B\u00edch Tr\u00e2m", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"B\u00edch Tr\u00e2m\" l\u00e0 \u0111\u1ed3 trang s\u1ee9c d\u00f9ng \u0111\u1ec3 c\u00e0i ch\u1eb7t m\u00e1i t\u00f3c ph\u1ee5 n\u1eef b\u1eb1ng ng\u1ecdc. \u0110\u1eb7t con t\u00ean \"B\u00edch Tr\u00e2m\" v\u1edbi \u00fd ngh\u0129a l\u00e0 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, ki\u1ec1u di\u1ec5m, cao qu\u00fd, t\u00e0i gi\u1ecfi, mong con \u0111\u01b0\u1ee3c y\u00eau th\u01b0\u01a1ng, chi\u1ec1u chu\u1ed9ng.", "sex": 5}
{"first_name": "Giao Tr\u00e2m", "meaning": "Giao d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng m\u1ed1i quan h\u1ec7 th\u00e2n thi\u1ec7n, b\u1ea1n b\u00e8, h\u1eefu ngh\u1ecb. Tr\u00e2m l\u00e0 ti\u1ec3u th\u01b0 khu\u00ea c\u00e1c, tr\u00e2m anh, v\u1eeba d\u1ecbu d\u00e0ng, th\u00f4ng minh, l\u1ea1i s\u1eafc s\u1ea3o v\u00e0 hi\u1ec3u bi\u1ebft, r\u1ea5t sang tr\u1ecdng, qu\u00fd ph\u00e1i. T\u00ean Giao Tr\u00e2m d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, \u0111\u00e0i c\u00e1t, v\u1eeba thanh cao, qu\u00fd ph\u00e1i, v\u1eeba th\u00f4ng minh, hi\u1ec3u bi\u1ebft", "sex": 5}
{"first_name": "H\u1ea1 Tr\u00e2m", "meaning": "\"H\u1ea1\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u00f9a h\u00e8, m\u1ed9t trong nh\u1eefng m\u00f9a s\u00f4i n\u1ed5i v\u1edbi nhi\u1ec1u ho\u1ea1t \u0111\u1ed9ng vui v\u1ebb c\u1ee7a n\u0103m. T\u00ean \"H\u1ea1 Tr\u00e2m\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, ti\u1ec3u th\u01b0 \u0111\u00e0i c\u00e1t, th\u00f9y m\u1ecb, n\u1ebft na. \"H\u1ea1 Tr\u00e2m\" c\u00f2n \u0111\u01b0\u1ee3c hi\u1ec3u l\u00e0 s\u1ef1 an nh\u00e0n, th\u01b0 th\u00e1i nh\u1eb9 nh\u00e0ng trong trong cu\u1ed9c s\u1ed1ng", "sex": 5}
{"first_name": "H\u1ea1nh Tr\u00e2m", "meaning": "Theo H\u00e1n - Vi\u1ec7t, \"H\u1ea1nh\" th\u1ee9 nh\u1ea5t, c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 ph\u00fac l\u1ed9c, l\u00e0 ph\u01b0\u1edbc l\u00e0nh. Ngh\u0129a th\u1ee9 hai l\u00e0 n\u00f3i v\u1ec1 m\u1eb7t \u0111\u1ea1o \u0111\u1ee9c, t\u00ednh n\u1ebft c\u1ee7a con ng\u01b0\u1eddi. T\u00ean \"H\u1ea1nh Tr\u00e2m\" ch\u1ec9 ng\u01b0\u1eddi xinh \u0111\u1eb9p, \u0111\u00e0i c\u00e1t, d\u1ecbu d\u00e0ng, n\u1ebft na, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, ph\u1ea9m ch\u1ea5t cao \u0111\u1eb9p, c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac, gi\u00e0u sang", "sex": 5}
{"first_name": "Ki\u1ec1u Tr\u00e2m", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ki\u1ec1u\" d\u00f9ng \u0111\u1ec3 g\u1ee3i \u0111\u1ebfn d\u00e1ng d\u1ea5p m\u1ec1m m\u1ea1i \u0111\u00e1ng y\u00eau, con g\u00e1i \u0111\u1eb9p. \"Tr\u00e2m\" l\u00e0 ti\u1ec3u th\u01b0 khu\u00ea c\u00e1c, v\u1eeba d\u1ecbu d\u00e0ng, th\u00f4ng minh, l\u1ea1i s\u1eafc s\u1ea3o v\u00e0 hi\u1ec3u bi\u1ebft, r\u1ea5t sang tr\u1ecdng, qu\u00fd ph\u00e1i. \"Ki\u1ec1u Trang\" l\u00e0 c\u00e1i t\u00ean th\u1ec3 hi\u1ec7n m\u1ed9t c\u00e1ch tinh t\u1ebf v\u1ec1 m\u1ed9t ng\u01b0\u1eddi con g\u00e1i t\u00e0i s\u1eafc v\u1eb9n to\u00e0n", "sex": 5}
{"first_name": "Minh Tr\u00e2m", "meaning": "\"Minh\" c\u00f3 ngh\u0129a l\u00e0 s\u00e1ng su\u1ed1t, th\u00f4ng minh. \"Tr\u00e2m\" l\u00e0 ti\u1ec3u th\u01b0 khu\u00ea c\u00e1c, tr\u00e2m anh. T\u00ean \"Minh Tr\u00e2m\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, thanh cao, sang tr\u1ecdng, t\u00ednh t\u00ecnh hi\u1ec1n h\u00f2a, \u0111\u00f4n h\u1eadu", "sex": 5}
{"first_name": "M\u1ef9 Tr\u00e2m", "meaning": "C\u00e2y tr\u00e2m \u0111\u1eb9p. L\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p, s\u1eafc s\u1ea3o, r\u1ea5t tinh t\u1ebf", "sex": 5}
{"first_name": "Ng\u1ecdc Tr\u00e2m", "meaning": "C\u00e2y tr\u00e2m b\u1eb1ng ng\u1ecdc, m\u1ed9t c\u00e1i t\u00ean g\u1eafn \u0111\u1ea7y n\u1eef t\u00ednh. Mong con lu\u00f4n xinh \u0111\u1eb9p, \u0111\u1ee9c h\u1ea1nh v\u00e0 thu\u1ea7n khi\u1ebft", "sex": 5}
{"first_name": "Nguy\u1ec7t Tr\u00e2m", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, nguy\u1ec7t l\u00e0 v\u1ea7ng tr\u0103ng, Tr\u0103ng c\u00f3 v\u1ebb \u0111\u1eb9p v\u00f4 c\u00f9ng b\u00ecnh d\u1ecb, m\u1ed9t v\u1ebb \u0111\u1eb9p kh\u00f4ng c\u1ea7n trang s\u1ee9c, \u0111\u1eb9p m\u1ed9t c\u00e1ch v\u00f4 t\u01b0, h\u1ed3n nhi\u00ean. Tr\u0103ng t\u01b0\u1ee3ng tr\u01b0ng cho v\u1ebb \u0111\u1eb9p h\u1ed3n nhi\u00ean n\u00ean tr\u0103ng ho\u00e0 v\u00e0o thi\u00ean nhi\u00ean, ho\u00e0 v\u00e0o c\u00e2y c\u1ecf. T\u00ean Nguy\u1ec7t Tr\u00e2m g\u1ee3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, \u0111\u00e0i c\u00e1t, th\u00f9y m\u1ecb, gi\u1ea3n d\u1ecb, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean", "sex": 5}
{"first_name": "Nh\u00e3 Tr\u00e2m", "meaning": "\"Tr\u00e2m\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfnti\u1ec3u th\u01b0 khu\u00ea c\u00e1c, tr\u00e2m anh, v\u1eeba d\u1ecbu d\u00e0ng, th\u00f4ng minh, l\u1ea1i s\u1eafc s\u1ea3o, sang tr\u1ecdng, qu\u00fd ph\u00e1i. \u0110i k\u00e8m v\u1edbi ch\u1eef \"Nh\u00e3\" n\u00f3i l\u00ean s\u1ef1 nh\u00e3 nh\u1eb7n. T\u00ean \"Nh\u00e3 Tr\u00e2m\" mang \u00fd ngh\u0129a \u0111\u1ed1i v\u1edbi ba m\u1eb9 con l\u00e0 ti\u1ec3u th\u01b0, b\u1ea3o b\u1ed1i, con xinh \u0111\u1eb9p, n\u1ebft na, th\u00f9y m\u1ecb v\u00e0 khi\u00eam nh\u01b0\u1eddng", "sex": 5}
{"first_name": "Qu\u1ef3nh Tr\u00e2m", "meaning": "T\u00ean c\u1ee7a m\u1ed9t lo\u1ea1i hoa tuy\u1ec7t \u0111\u1eb9p. Mong con lu\u00f4n xinh \u0111\u1eb9p, ki\u00eau sa v\u00e0 h\u1ea1nh ph\u00fac", "sex": 5}
