{"first_name": "C\u00f4ng Tr\u00e1c", "meaning": "\"C\u00f4ng\" l\u00e0 c\u00e1i chung. \"C\u00f4ng Tr\u00e1c\" l\u00e0 n\u1ed7 l\u1ef1c m\u00e0i gi\u0169a v\u00ec c\u00e1i chung, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi nhi\u1ec7t huy\u1ebft, quy\u1ebft li\u1ec7t, c\u00f3 tr\u00e1ch nhi\u1ec7m c\u1ed9ng \u0111\u1ed3ng.", "sex": 3}
{"first_name": "H\u1eefu Tr\u00e1c", "meaning": "\"H\u1eefu\" l\u00e0 \u0111i\u1ec1u ph\u1ea3i. \"H\u1eefu Tr\u00e1c\" l\u00e0 m\u00e0i gi\u0169a \u0111i\u1ec1u ph\u1ea3i, ch\u1ec9 v\u00e0o con ng\u01b0\u1eddi c\u00f4ng minh ch\u00ednh tr\u1ef1c, h\u00e0nh \u0111\u1ed9ng l\u1ed7i l\u1ea1c \u0111\u01b0\u1eddng ho\u00e0ng.", "sex": 3}
{"first_name": "H\u1ed3ng Tr\u1ea1m", "meaning": "\"H\u1ed3ng\" l\u00e0 m\u00e0u \u0111\u1ecf, ch\u1ec9 s\u1ef1 may m\u1eafn, \"H\u1ed3ng Tr\u1ea1m\" l\u00e0 \u0111i\u1ec3m d\u1eebng may m\u1eafn, th\u1ec3  hi\u1ec7n t\u00e2m l\u00fd cha m\u1eb9 mu\u1ed1n con c\u00f3 m\u1ed9t cu\u1ed9c s\u1ed1ng h\u1ea1nh ph\u01b0\u1edbc d\u1ed3i d\u00e0o, lu\u00f4n g\u1eb7p \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p.", "sex": 5}
{"first_name": "Nam Tr\u1ea5n", "meaning": "\"Tr\u1ea5n\" l\u00e0 g\u00ecn gi\u1eef. \"Nam Tr\u1ea5n\" l\u00e0 g\u00ecn gi\u1eef n\u01b0\u1edbc Nam, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi b\u1ea3n l\u0129nh, y\u00eau n\u01b0\u1edbc.", "sex": 3}
{"first_name": "\u0110\u00ecnh Tr\u1ea1c", "meaning": "\u0110\u00ecnh l\u00e0 n\u01a1i quan vi\u00ean l\u00e0m vi\u1ec7c. \u0110\u00ecnh Tr\u1ea1c l\u00e0 c\u00e2y m\u1ecdc th\u1eb3ng ch\u1ed1n quan tr\u01b0\u1eddng, ch\u1ec9 con ng\u01b0\u1eddi li\u00ean khi\u1ebft ch\u00ednh tr\u1ef1c, t\u00e0i tr\u00ed nh\u00e2n s\u00e1ch", "sex": 3}
