{"first_name": "Anh Tr\u00e2n", "meaning": "Ch\u1eef Anh theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 \u201cng\u01b0\u1eddi t\u00e0i gi\u1ecfi\u201d v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. \"Tr\u00e2n\" c\u00f3 ngh\u0129a l\u00e0 b\u00e1u, qu\u00fd, hi\u1ebfm c\u00f3, qu\u00fd tr\u1ecdng, coi tr\u1ecdng, d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi xinh \u0111\u1eb9p, qu\u00fd ph\u00e1i.   \u0110\u0103\u0323t t\u00ean \"Anh Tr\u00e2n\" cho con, b\u00f4\u0301 m\u1eb9 mong con s\u1ebd c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac, gi\u00e0u sang, \u0111\u01b0\u1ee3c y\u00eau th\u01b0\u01a1ng, , tr\u00e2n quy\u0301.", "sex": 5}
{"first_name": "B\u1ea3o Tr\u00e2n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"B\u1ea3o\" v\u00e0 \"Tr\u00e2n\" \u0111\u1ec1u c\u00f3 ngh\u0129a l\u00e0 v\u1eadt tr\u00e2n qu\u00fd, qu\u00fd b\u00e1u, hi\u1ebfm c\u00f3. T\u00ean \"B\u1ea3o Tr\u00e2n\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, th\u00f4ng minh, t\u00ednh c\u00e1ch cao sang, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, chi\u1ec1u chu\u1ed9ng. \u0110\u1ed3ng th\u1eddi c\u0169ng n\u00f3i l\u00ean th\u00f4ng \u0111i\u1ec7p \"con l\u00e0 m\u00f3n qu\u00e0 qu\u00fd gi\u00e1 nh\u1ea5t d\u00e0nh cho cha m\u1eb9\".", "sex": 5}
{"first_name": "B\u00edch Tr\u00e2n", "meaning": "Ch\u1eef \"B\u00edch\" v\u00e0 ch\u1eef \"Tr\u00e2n\" \u0111\u1ec1u n\u00f3i \u0111\u1ebfn nh\u1eefng v\u1eadt qu\u00fd gi\u00e1, hi\u1ebfm c\u00f3, \u0111\u01b0\u1ee3c qu\u00fd tr\u1ecdng, tr\u00e2n tr\u1ecdng. \"B\u00edch Tr\u00e2n\" l\u00e0 s\u1ef1 k\u1ebft h\u1ee3p kh\u00e1 tinh t\u1ebf n\u00f3i l\u00ean s\u1ef1 thanh cao, tao nh\u00e3 v\u00e0 c\u00f3 ch\u00fat g\u00ec \u0111\u00f3 quy\u1ec1n qu\u00fd, sang tr\u1ecdng. Ng\u01b0\u1eddi t\u00ean \"B\u00edch Tr\u00e2n\" th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p, c\u00f3 s\u1ef1 nh\u1ea1y b\u00e9n, s\u1eafc s\u1ea3o trong suy ngh\u0129 v\u00e0 t\u01b0 duy, lu\u00f4n \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, chi\u1ec1u chu\u1ed9ng.", "sex": 5}
