{"first_name": "H\u1ea1nh Tr\u00e2n", "meaning": "Theo H\u00e1n - Vi\u1ec7t, \"H\u1ea1nh\" th\u1ee9 nh\u1ea5t, c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 ph\u00fac l\u1ed9c, l\u00e0 ph\u01b0\u1edbc l\u00e0nh. Ngh\u0129a th\u1ee9 hai l\u00e0 n\u00f3i v\u1ec1 m\u1eb7t \u0111\u1ea1o \u0111\u1ee9c, t\u00ednh n\u1ebft c\u1ee7a con ng\u01b0\u1eddi. T\u00ean \"H\u1ea1nh Tr\u00e2n\" ch\u1ec9 ng\u01b0\u1eddi xinh \u0111\u1eb9p, thanh cao, hi\u1ec1n l\u00e0nh, d\u1ecbu d\u00e0ng, n\u1ebft na, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, ph\u1ea9m ch\u1ea5t cao \u0111\u1eb9p, c\u00f3 cu\u1ed9c s\u1ed1ng sung t\u00fac, gi\u00e0u sang", "sex": 5}
{"first_name": "Nam Tr\u00e2n", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Tr\u00e2n th\u1ec3 hi\u1ec7n s\u1ef1 y\u00eau qu\u00fd c\u1ee7a cha m\u1eb9 d\u00e0nh cho con, mong con s\u1ebd nh\u1eadn \u0111\u01b0\u1ee3c m\u1ecdi th\u1ee9 t\u1ed1t \u0111\u1eb9p nh\u1ea5t", "sex": 5}
{"first_name": "Ng\u1ecdc Tr\u00e2n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ng\u1ecdc\" v\u00e0 \"Tr\u00e2n\" \u0111\u1ec1u d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng vi\u00ean ng\u1ecdc qu\u00fd, v\u1eadt qu\u00fd b\u00e1u. T\u00ean \"Ng\u1ecdc Tr\u00e2n\" th\u1ec3 hi\u1ec7n ni\u1ec1m y\u00eau th\u01b0\u01a1ng, vui m\u1eebng c\u1ee7a cha m\u1eb9 khi c\u00f3 con, mong con lu\u00f4n xinh \u0111\u1eb9p, ki\u1ec1u di\u1ec5m, quy\u1ec1n qu\u00fd, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi n\u00e2ng niu, chi\u1ec1u chu\u1ed9ng.", "sex": 5}
{"first_name": "Nguy\u1ec7t Tr\u00e2n", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, nguy\u1ec7t l\u00e0 v\u1ea7ng tr\u0103ng, Tr\u0103ng c\u00f3 v\u1ebb \u0111\u1eb9p v\u00f4 c\u00f9ng b\u00ecnh d\u1ecb, m\u1ed9t v\u1ebb \u0111\u1eb9p kh\u00f4ng c\u1ea7n trang s\u1ee9c, \u0111\u1eb9p m\u1ed9t c\u00e1ch v\u00f4 t\u01b0, h\u1ed3n nhi\u00ean. Tr\u0103ng t\u01b0\u1ee3ng tr\u01b0ng cho v\u1ebb \u0111\u1eb9p h\u1ed3n nhi\u00ean n\u00ean tr\u0103ng ho\u00e0 v\u00e0o thi\u00ean nhi\u00ean, ho\u00e0 v\u00e0o c\u00e2y c\u1ecf. T\u00ean Nguy\u1ec7t Tr\u00e2n \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau, s\u1ed1ng trong vinh hoa, ph\u00fa qu\u00fd", "sex": 5}
{"first_name": "Nh\u00e3 Tr\u00e2n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Tr\u00e2n\" c\u00f3 ngh\u0129a l\u00e0 b\u00e1u, qu\u00fd, hi\u1ebfm c\u00f3, qu\u00fd tr\u1ecdng, coi tr\u1ecdng. \"Nh\u00e3\" l\u00e0 nh\u00e3 nh\u1eb7n, b\u00ecnh d\u1ecb, kh\u00f4ng ph\u00f4 tr\u01b0\u01a1ng. T\u00ean \"Nh\u00e3 Tr\u00e2n\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi xinh \u0111\u1eb9p, qu\u00fd ph\u00e1i, nh\u01b0ng kh\u00f4ng v\u00ec th\u1ebf m\u00e0 tr\u1edf n\u00ean ki\u00eau k\u1ef3, m\u00e0 lu\u00f4n hi\u1ec3u bi\u1ebft v\u00e0 khi\u00eam nh\u01b0\u1eddng", "sex": 5}
{"first_name": "\u0110\u00f4ng Tr\u00e3i", "meaning": "\"\u0110\u00f4ng\" l\u00e0 n\u01a1i quan vi\u00ean l\u00e0m vi\u1ec7c. \"\u0110\u00f4ng Tr\u00e3i\" ngh\u0129a l\u00e0 linh th\u00fa n\u01a1i c\u1eeda quan, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi c\u00f3 t\u00e0i n\u0103ng \u0111\u1eb7c bi\u1ec7t, \u0111\u01b0\u1ee3c tr\u1ecdng d\u1ee5ng ng\u01b0\u1ee1ng m\u1ed9.", "sex": 3}
{"first_name": "C\u00f4ng Tr\u00e1ng", "meaning": "\"C\u00f4ng\" l\u00e0 c\u1ee7a chung. \"C\u00f4ng Tr\u00e1ng\" l\u00e0 ng\u01b0\u1eddi h\u00e0nh s\u1ef1 v\u00ec c\u00e1i chung, n\u1ed7 l\u1ef1c v\u00ec tr\u00e1ch nhi\u1ec7m c\u1ed9ng \u0111\u1ed3ng.", "sex": 3}
{"first_name": "C\u00f4n Tr\u1ea7n", "meaning": "\"Tr\u1ea7n\" l\u00e0 ch\u1ed1n nh\u00e2n sinh. \"C\u00f4n Tr\u1ea7n\" ng\u1ee5 \u00fd con ng\u01b0\u1eddi cao c\u1ea3 gi\u1eefa cu\u1ed9c \u0111\u1eddi, th\u00e0nh c\u00f4ng v\u00e0 hi\u1ec3n \u0111\u1ea1t.", "sex": 3}
{"first_name": "Quang Tr\u1ea3i", "meaning": "\"Quang\" l\u00e0 \u00e1nh s\u00e1ng. \"Quang Tr\u1ea3i\" l\u00e0 m\u1edf toang ra, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi trung th\u1ef1c c\u00f4ng minh, h\u00e0nh \u0111\u1ed9ng ch\u00ednh tr\u1ef1c.", "sex": 3}
{"first_name": "\u0110\u00f4ng Tr\u00e0ng", "meaning": "\"\u0110\u00f4ng\" l\u00e0 ph\u00eda \u0111\u00f4ng, ch\u1ec9 n\u01a1i quan vi\u00ean l\u00e0m vi\u1ec7c. \"\u0110\u00f4ng Tr\u00e0ng\" l\u00e0 ng\u01b0\u1eddi ng\u1ed3i \u1edf ph\u00eda \u0111\u00f4ng, ng\u1ee5  \u00fd ng\u01b0\u1eddi t\u00e0i gi\u1ecfi xu\u1ea5t ch\u00fang.", "sex": 3}
{"first_name": "C\u00f4ng Tr\u00e1m", "meaning": "\"C\u00f4ng Tr\u00e1m\" \u0111\u01b0\u1ee3c hi\u1ec3u l\u00e0 h\u00e0nh \u0111\u1ed9ng x\u1eed l\u00fd v\u00ec c\u00e1i chung, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi c\u00f3 b\u1ea3n l\u0129nh tr\u00e1ch nhi\u1ec7m cao.", "sex": 3}
{"first_name": "B\u1ea3o Trang", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"B\u1ea3o\" ngh\u0129a l\u00e0 b\u1ea3o v\u1eadt, kho b\u00e1u, b\u1ea3o b\u1ed1i, \"Trang\" l\u00e0 nh\u00e3 nh\u1eb7n, th\u00f4ng minh. T\u00ean \"B\u1ea3o Trang\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, lanh l\u1ee3i, t\u00e0i gi\u1ecfi, nh\u1ea1y b\u00e9n, bi\u1ebft c\u00e1ch \u1ee9ng x\u1eed tinh t\u1ebf. T\u00ean \"B\u1ea3o Trang\" v\u1edbi \u00fd ngh\u0129a con l\u00e0 v\u1eadt b\u00e1u, l\u00e0 \u0111\u1ee9a con th\u00f4ng minh, xinh \u0111\u1eb9p c\u1ee7a b\u1ed1 m\u1eb9.", "sex": 5}
{"first_name": "B\u00edch Trang", "meaning": "Ch\u1eef \"B\u00edch\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 l\u00e0 t\u1eeb d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u1ed9t lo\u00e0i qu\u00fd th\u1ea1ch c\u00f3 t\u1ef1 l\u00e2u \u0111\u1eddi, \u0111\u1eb7c t\u00ednh c\u00e0ng m\u00e0i d\u0169a s\u1ebd c\u00e0ng b\u00f3ng lo\u00e1ng nh\u01b0 g\u01b0\u01a1ng, ch\u1eef \"Trang\" L\u00e0 trang nh\u00e3, d\u1ecbu d\u00e0ng, tao nh\u00e3, lu\u00f4n gi\u1eef \u0111\u01b0\u1ee3c s\u1ef1 chu\u1ea9n m\u1ef1c v\u00e0 qu\u00fd ph\u00e1i. \"B\u00edch Trang\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean nh\u1eb9 nh\u00e0ng \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi khao kh\u00e1t con s\u1ebd xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, \u0111\u1eb1m th\u1eafm, \u0111\u1ee9c h\u1ea1nh v\u00e0 t\u00e0i n\u0103ng.", "sex": 5}
