{"first_name": "H\u1ea1 Trang", "meaning": "\"H\u1ea1\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 m\u00f9a h\u00e8, m\u1ed9t trong nh\u1eefng m\u00f9a s\u00f4i n\u1ed5i v\u1edbi nhi\u1ec1u ho\u1ea1t \u0111\u1ed9ng vui v\u1ebb c\u1ee7a n\u0103m. T\u00ean \"H\u1ea1 Trang\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi trang nh\u00e3, d\u1ecbu d\u00e0ng, tao nh\u00e3, lu\u00f4n gi\u1eef \u0111\u01b0\u1ee3c s\u1ef1 chu\u1ea9n m\u1ef1c v\u00e0 qu\u00fd ph\u00e1i, lu\u00f4n vui v\u1ebb v\u00e0 ho\u1ea1t b\u00e1t", "sex": 5}
