{"first_name": "Ki\u1ec1u Trang", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ki\u1ec1u\" d\u00f9ng \u0111\u1ec3 g\u1ee3i \u0111\u1ebfn d\u00e1ng d\u1ea5p m\u1ec1m m\u1ea1i \u0111\u00e1ng y\u00eau, con g\u00e1i \u0111\u1eb9p. \"Trang\" l\u00e0 trang nh\u00e3, d\u1ecbu d\u00e0ng, tao nh\u00e3, lu\u00f4n gi\u1eef \u0111\u01b0\u1ee3c s\u1ef1 chu\u1ea9n m\u1ef1c v\u00e0 qu\u00fd ph\u00e1i. T\u00ean \"Ki\u1ec1u Trang\" n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, ki\u1ec1u di\u1ec5m, \u0111\u00e1ng y\u00eau, \u0111oan trang, th\u00f9y m\u1ecb", "sex": 5}
{"first_name": "Mai Trang", "meaning": "\"Mai\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p n\u1edf v\u00e0o \u0111\u1ea7u m\u00f9a xu\u00e2n - m\u1ed9t m\u00f9a xu\u00e2n tr\u00e0n tr\u1ec1 \u01b0\u1edbc m\u01a1 v\u00e0 hy v\u1ecdng. T\u00ean \"Mai Trang\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 v\u00f3c d\u00e1ng thanh t\u00fa, t\u00ednh c\u00e1ch d\u1ecbu d\u00e0ng, \u0111\u1eb1m th\u1eafm, th\u00f9y m\u1ecb, \u0111\u00e1ng y\u00eau, lu\u00f4n tr\u00e0n \u0111\u1ea7y s\u1ee9c s\u1ed1ng \u0111\u1ec3 b\u1eaft \u0111\u1ea7u m\u1ecdi vi\u1ec7c.", "sex": 5}
{"first_name": "Minh Trang", "meaning": "\"Trang\" l\u00e0 \u0111oan trang, d\u1ecbu d\u00e0ng n\u1eef t\u00ednh; \"Minh\" l\u00e0 trong s\u00e1ng, th\u00f4ng minh, s\u00e1ng su\u1ed1t. \"Minh Trang\"  mang \u00fd ngh\u0129a\" con l\u00e0 ng\u01b0\u1eddi con g\u00e1i v\u1eeba th\u00f4ng minh v\u1eeba \u0111oan trang, c\u00f3 v\u1ebb \u0111\u1eb9p k\u00edn \u0111\u00e1o, nh\u1eb9 nh\u00e0ng \u0111\u1ea7y n\u1eef t\u00ednh.", "sex": 5}
{"first_name": "My Trang", "meaning": "\"My\" c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau. \"Trang\" l\u00e0 d\u1ecbu d\u00e0ng, tao nh\u00e3. \"My Trang\" ngh\u0129a l\u00e0 con xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng tao nh\u00e3, trang \u0111\u00e0i nh\u01b0 khu\u00ea n\u1eef ng\u00e0y x\u01b0a.", "sex": 5}
{"first_name": "Ng\u1ecdc Trang", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc \u0111\u1eb9p r\u1ef1c r\u1ee1, b\u1ec1 m\u1eb7t s\u00e1ng trong l\u1ea5p l\u00e1nh... th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c, \"Trang\" l\u00e0 \u0111oan trang, v\u1ebb \u0111\u1eb9p k\u00edn \u0111\u00e1o, d\u1ecbu d\u00e0ng, n\u1eef t\u00ednh, n\u1ebft na. T\u00ean \"Ng\u1ecdc Trang\" g\u1ee3i l\u00ean v\u1ebb \u0111\u1eb9p th\u00f9y m\u1ecb, \u0111oan trang c\u00f9ng t\u00e2m h\u1ed3n trong s\u00e1ng, cao qu\u00fd v\u00e0 thanh khi\u1ebft nh\u01b0 ng\u1ecdc.", "sex": 5}
{"first_name": "Nguy\u1ec7t Trang", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, nguy\u1ec7t l\u00e0 v\u1ea7ng tr\u0103ng, Tr\u0103ng c\u00f3 v\u1ebb \u0111\u1eb9p v\u00f4 c\u00f9ng b\u00ecnh d\u1ecb, m\u1ed9t v\u1ebb \u0111\u1eb9p kh\u00f4ng c\u1ea7n trang s\u1ee9c, \u0111\u1eb9p m\u1ed9t c\u00e1ch v\u00f4 t\u01b0, h\u1ed3n nhi\u00ean. Tr\u0103ng t\u01b0\u1ee3ng tr\u01b0ng cho v\u1ebb \u0111\u1eb9p h\u1ed3n nhi\u00ean n\u00ean tr\u0103ng ho\u00e0 v\u00e0o thi\u00ean nhi\u00ean, ho\u00e0 v\u00e0o c\u00e2y c\u1ecf. T\u00ean Nguy\u1ec7t Trang g\u1ee3i \u0111\u1ebfn h\u00ecnh \u1ea3nh ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, nh\u00e3 nh\u1eb7n, \u0111oan trang, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean", "sex": 5}
{"first_name": "Nh\u00e3 Trang", "meaning": "\"Nh\u00e3\" l\u00e0 nh\u00e3 nh\u1eb7n, b\u00ecnh d\u1ecb. \"Trang\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa, hoa Trang, c\u00f3 l\u00e1 nh\u01b0 hoa s\u00fang nh\u01b0ng l\u00e1 nh\u1ecf h\u01a1n, hoa b\u00e9 t\u00ed x\u00edu m\u00e0u tr\u1eafng \u0111\u1eb9p l\u1eafm th\u01b0\u1eddng s\u1ed1ng \u1edf h\u1ed3 ao. T\u00ean \"Nh\u00e3 Trang\" g\u1ee3i \u0111\u1ebfn h\u00ecnh \u1ea3nh ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, y\u00eau ki\u1ec1u, d\u1ecbu d\u00e0ng, \u0111\u1eb1m th\u1eafm, m\u1ed9c m\u1ea1c, nh\u01b0ng tr\u00e0n \u0111\u1ea7y s\u1ee9c s\u1ed1ng, b\u1ea3n l\u0129nh, kh\u00f4ng s\u1ee3 kh\u00f3 kh\u0103n, th\u00e1ch th\u1ee9c", "sex": 5}
{"first_name": "Nhi Trang", "meaning": "\"Nhi Trang\" ngh\u0129a l\u00e0 mong con thanh cao, xinh \u0111\u1eb9p.", "sex": 5}
{"first_name": "Nhung Trang", "meaning": "\"Nhung\" c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p, m\u1ec1m m\u1ea1i, d\u1ecbu d\u00e0ng v\u00e0 cao sang nh\u01b0 g\u1ea5m nhung. \"Trang\" trong ch\u1eef trang nh\u00e3, d\u1ecbu d\u00e0ng v\u00ec v\u1eady \"Nhung Trang\" l\u00e0 c\u00e1i t\u00ean mang \u00fd ngh\u0129a r\u1eb1ng con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p, tao nh\u00e3, thanh cao.", "sex": 5}
