{"first_name": "Qu\u1ef3nh Trang", "meaning": "\"Qu\u1ef3nh\" \u1edf \u0111\u00e2y l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa \u0111\u1eb9p c\u00f3 m\u00e0u tr\u1eafng tinh kh\u00f4i, m\u00f9i h\u01b0\u01a1ng d\u1ecbu d\u00e0ng thanh khi\u1ebft, th\u01b0\u1eddng n\u1edf v\u00e0o l\u00fac 12 gi\u1edd \u0111\u00eam. Theo t\u1eeb \u0111i\u1ec3n Ti\u1ebfng Vi\u1ec7t, \"Trang\" c\u00f3 ngh\u0129a l\u00e0 \u0111oan trang, v\u1ebb \u0111\u1eb9p k\u00edn \u0111\u00e1o, hi\u1ec1n d\u1ecbu, n\u1ebft na. T\u00ean \"Qu\u1ef3nh Trang\" g\u1ee3i l\u00ean v\u1ebb \u0111\u1eb9p v\u1eeba cao sang, v\u1eeba d\u1ecbu d\u00e0ng thu\u1ea7n khi\u00ea\u0301t m\u00e0 \u0111\u1ea7y n\u1eef t\u00ednh.", "sex": 5}
{"first_name": "Th\u1ea3o Trang", "meaning": "Con g\u00e1i c\u1ee7a m\u1eb9 kh\u00f4ng ch\u1ec9 \u0111oan trang d\u1ecbu d\u00e0ng m\u00e0 c\u00f2n hi\u1ebfu th\u1ea3o, n\u1ebft na", "sex": 5}
{"first_name": "Thu Trang", "meaning": "\"Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\"Thu\"\" c\u00f3 ngh\u0129a l\u00e0 m\u00f9a thu - m\u00f9a chuy\u1ec3n giao gi\u1eefa h\u1ea1 v\u00e0 \u0111\u00f4ng, th\u1eddi ti\u1ebft m\u00e1t m\u1ebb d\u1ea7n, \"\"Trang\"\" c\u00f3 ngh\u0129a l\u00e0 trang nh\u00e3, l\u1ecbch s\u1ef1, \u0111\u00e0i c\u00e1c.\r\nKhi \u0111\u1eb7t t\u00ean \"\"Thu Trang\"\" cho con, b\u1ed1 m\u1eb9 mu\u1ed1n b\u00e9 g\u00e1i c\u1ee7a m\u00ecnh khi l\u1edbn l\u00ean s\u1ebd d\u1ecbu d\u00e0ng nh\u01b0 m\u00f9a thu, ki\u00eau sa, \u0111\u00e0i c\u00e1c v\u00e0 sang tr\u1ecdng \u0111\u1ec3 ai c\u0169ng ng\u01b0\u1ee1ng m\u1ed9.\"", "sex": 5}
{"first_name": "Th\u00fay Trang", "meaning": "\"Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\"Th\u00fay\"\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng c\u00f4 g\u00e1i li\u1ec5u y\u1ebfu \u0111\u00e0o t\u01a1, r\u1ea5t xinh \u0111\u1eb9p v\u00e0 n\u1eef t\u00ednh, \"\"Trang\"\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u00e0i c\u00e1c v\u00e0 ngay ng\u1eafn.\r\nKhi \u0111\u1eb7t t\u00ean \"\"Th\u00fay Trang\"\" b\u1ed1 m\u1eb9 mong con sau n\u00e0y l\u1edbn l\u00ean s\u1ebd tr\u1edf th\u00e0nh c\u00f4 g\u00e1i m\u00ea\u0300m mo\u0309ng, xinh \u0111\u1eb9p, \u0111oan trang, th\u00f9y m\u1ecb.\"", "sex": 5}
