{"first_name": "Minh Tri", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, \"Minh\" mang ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh, t\u00e0i tr\u00ed. \"Tri\" ngo\u00e0i ngh\u0129a l\u00e0 tr\u00ed, t\u1ee9c l\u00e0 c\u00f3 hi\u1ec3u bi\u1ebft, tr\u00ed tu\u1ec7, c\u00f2n d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn  ng\u01b0\u1eddi b\u1ea1n th\u00e2n r\u1ea5t hi\u1ec3u l\u00f2ng m\u00ecnh. T\u00ean \"Minh Tri\" mang \u00fd ngh\u0129a mong con l\u00e0 ng\u01b0\u1eddi c\u00f3 tr\u00ed th\u1ee9c, th\u00f4ng minh, gi\u1ecfi giang, th\u00e2n thi\u1ec7n, \u00f4n h\u00f2a", "sex": 5}
{"first_name": "Nam Tri", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Tri\" l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh t\u00e0i tr\u00ed, nhanh nh\u1eb9n. \"D\u00e2n\" ch\u1ec9 s\u1ef1 b\u00ecnh d\u00e2n gi\u1ea3i d\u1ecb, d\u00e2n gi\u1ea3. \"D\u00e2n Tri\" l\u00e0 c\u00e1i t\u00ean th\u1ec3 hi\u1ec7n mong mu\u1ed1n con th\u00f4ng minh t\u00e0i tr\u00ed, nh\u01b0ng v\u1eabn gi\u1eef \u0111\u01b0\u1ee3c v\u1ebb \u0111\u1eb9p b\u00ecnh d\u00e2n gi\u1ea3n d\u1ecb.", "sex": 3}
{"first_name": "Ng\u1ecdc Tri", "meaning": "\"Ng\u1ecdc\" theo ti\u1ebfng H\u00e1n vi\u1ec7t l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh,... th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed. \"Tri\" ngo\u00e0i ngh\u0129a l\u00e0 tr\u00ed, t\u1ee9c l\u00e0 c\u00f3 hi\u1ec3u bi\u1ebft, tr\u00ed tu\u1ec7, c\u00f2n d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn  ng\u01b0\u1eddi b\u1ea1n th\u00e2n r\u1ea5t hi\u1ec3u l\u00f2ng m\u00ecnh. T\u00ean Ng\u1ecdc Tri th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, th\u00f4ng minh, t\u1ecfa s\u00e1ng nh\u01b0 h\u00f2n ng\u1ecdc qu\u00fd, mang \u00fd ngh\u0129a l\u00e0 tr\u00e2n b\u1ea3o, l\u00e0 m\u00f3n qu\u00e0 qu\u00fd gi\u00e1 c\u1ee7a t\u1ea1o h\u00f3a", "sex": 5}
{"first_name": "Nguy\u1ec7t Tri", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, nguy\u1ec7t l\u00e0 v\u1ea7ng tr\u0103ng, Tr\u0103ng c\u00f3 v\u1ebb \u0111\u1eb9p v\u00f4 c\u00f9ng b\u00ecnh d\u1ecb, m\u1ed9t v\u1ebb \u0111\u1eb9p kh\u00f4ng c\u1ea7n trang s\u1ee9c, \u0111\u1eb9p m\u1ed9t c\u00e1ch v\u00f4 t\u01b0, h\u1ed3n nhi\u00ean. Tr\u0103ng t\u01b0\u1ee3ng tr\u01b0ng cho v\u1ebb \u0111\u1eb9p h\u1ed3n nhi\u00ean n\u00ean tr\u0103ng ho\u00e0 v\u00e0o thi\u00ean nhi\u00ean, ho\u00e0 v\u00e0o c\u00e2y c\u1ecf. \"Tri\" ngo\u00e0i ngh\u0129a l\u00e0 tr\u00ed, t\u1ee9c l\u00e0 c\u00f3 hi\u1ec3u bi\u1ebft, tr\u00ed tu\u1ec7, c\u00f2n d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn  ng\u01b0\u1eddi b\u1ea1n th\u00e2n r\u1ea5t hi\u1ec3u l\u00f2ng m\u00ecnh. T\u00ean Nguy\u1ec7t Tri mang \u00fd ngh\u0129a v\u1ec1 n\u00e9t \u0111\u1eb9p b\u00ecnh d\u1ecb, n\u00ean th\u01a1 c\u1ee7a ng\u01b0\u1eddi con g\u00e1i  gi\u1ea3n d\u1ecb, th\u00f4ng minh, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean, hi\u1ec1n l\u00e0nh, \u0111\u1ee9c h\u1ea1nh", "sex": 5}
{"first_name": "Nh\u1eadt Tri", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Nh\u1eadt\" c\u00f3 ngh\u0129a l\u00e0 m\u1eb7t tr\u1eddi, th\u00e1i d\u01b0\u01a1ng. \"Tri\" ngo\u00e0i ngh\u0129a l\u00e0 tr\u00ed, t\u1ee9c l\u00e0 c\u00f3 hi\u1ec3u bi\u1ebft, tr\u00ed tu\u1ec7, c\u00f2n d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn  ng\u01b0\u1eddi b\u1ea1n th\u00e2n r\u1ea5t hi\u1ec3u l\u00f2ng m\u00ecnh. T\u00ean \"Nh\u1eadt Tri\" th\u1ec3 hi\u1ec7n mong mu\u1ed1n con th\u00f4ng minh, tr\u00ed tu\u1ec7, th\u00e2n thi\u1ec7n, \u00f4n h\u00f2a, c\u00f3 nhi\u1ec1u b\u1ea1n b\u00e8 qu\u00fd m\u1ebfn", "sex": 7}
{"first_name": "Ph\u01b0\u01a1ng Tri", "meaning": "Ch\u1eef  \"Ph\u01b0\u01a1ng\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t ngh\u0129a l\u00e0 h\u01b0\u1edbng, v\u1ecb tr\u00ed, \u0111\u1ea1o l\u00fd. T\u00ean \"Ph\u01b0\u01a1ng Tri\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi bi\u1ebft \u0111\u1ea1o l\u00fd l\u00e0m ng\u01b0\u1eddi, bi\u1ebft ph\u00e2n bi\u1ec7t t\u1ed1t x\u1ea5u, \u0111\u00fang sai. Th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi s\u00e1ng su\u1ed1t, tr\u00ed tu\u1ec7. T\u00ean \"Ph\u01b0\u01a1ng Tri\" l\u00e0 mong mu\u1ed1n c\u1ee7a cha m\u1eb9 mu\u1ed1n con m\u00ecnh lu\u00f4n l\u00e0m nh\u1eefng \u0111i\u1ec1u t\u1ed1t, bi\u1ebft c\u00e1ch \u0111\u1ed1i nh\u00e2n x\u1eed th\u1ebf, l\u00e0m cha m\u1eb9 y\u00ean l\u00f2ng", "sex": 5}
{"first_name": "Thanh Tri", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 trong s\u00e1ng, trong s\u1ea1ch, thanh khi\u1ebft. \"Tri\" ngo\u00e0i ngh\u0129a l\u00e0 tr\u00ed, t\u1ee9c l\u00e0 c\u00f3 hi\u1ec3u bi\u1ebft, tr\u00ed tu\u1ec7, c\u00f2n d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn  ng\u01b0\u1eddi b\u1ea1n th\u00e2n r\u1ea5t hi\u1ec3u l\u00f2ng m\u00ecnh. T\u00ean \"Thanh Tri\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, s\u00e1ng su\u1ed1t, th\u00e2n thi\u1ec7n, s\u1ed1ng trong s\u1ea1ch, li\u00eam khi\u1ebft", "sex": 7}
{"first_name": "Th\u00fay Tri", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn vi\u00ean ng\u1ecdc \u0111\u1eb9p, ng\u1ecdc qu\u00fd. \"Tri\" ngo\u00e0i ngh\u0129a l\u00e0 tr\u00ed, t\u1ee9c l\u00e0 c\u00f3 hi\u1ec3u bi\u1ebft, tr\u00ed tu\u1ec7, c\u00f2n d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn  ng\u01b0\u1eddi b\u1ea1n th\u00e2n r\u1ea5t hi\u1ec3u l\u00f2ng m\u00ecnh. \"Th\u00fay Tri\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd lu\u00f4n th\u00f4ng minh, hi\u1ec3u bi\u1ebft, xinh \u0111\u1eb9p, quy\u1ec1n qu\u00fd, \u0111\u01b0\u1ee3c tr\u00e2n tr\u1ecdng v\u00e0 n\u00e2ng niu", "sex": 5}
{"first_name": "Quang Tr\u00e1t", "meaning": "\"Quang\" l\u00e0 \u00e1nh s\u00e1ng. \"Quang Tr\u00e1t\" l\u00e0 m\u1ec7nh l\u1ec7nh t\u1ecf t\u01b0\u1eddng, ch\u1ec9 v\u00e0o ng\u01b0\u1eddi c\u00f3 t\u1ed1 ch\u1ea5t l\u00e3nh \u0111\u1ea1o, m\u1ecdi vi\u1ec7c suy x\u00e9t minh b\u1ea1ch.", "sex": 3}
