{"first_name": "Anh Tr\u00ed", "meaning": "Ch\u1eef \"Anh\" theo ngh\u0129a H\u00e1n Vi\u1ec7t l\u00e0 \u201cng\u01b0\u1eddi t\u00e0i gi\u1ecfi\u201d v\u1edbi \u00fd ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i, th\u00f4ng minh, gi\u1ecfi giang tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n, \"Tr\u00ed\" l\u00e0 tr\u00ed kh\u00f4n, tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft. V\u00ec v\u1eady t\u00ean \"Anh Tr\u00ed\" th\u1ec3 hi\u1ec7n mong mu\u1ed1n t\u1ed1t \u0111\u1eb9p c\u1ee7a cha m\u1eb9 \u0111\u1ec3 con m\u00ecnh gi\u1ecfi giang, xu\u1ea5t ch\u00fang khi \u0111\u01b0\u1ee3c \u0111\u1eb7t t\u00ean n\u00e0y.", "sex": 3}
{"first_name": "B\u1ed5n Tr\u00ed", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Tr\u00ed\" l\u00e0 tr\u00ed kh\u00f4n, tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft. \"B\u1ed5n\" t\u1ee9c  b\u1ed5n l\u0129nh \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. T\u00ean \"B\u1ed5n Tr\u00ed\" l\u00e0 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, tr\u00ed tu\u1ec7, t\u00e0i gi\u1ecfi. Cha m\u1eb9 mong con l\u00e0 \u0111\u1ee9a con c\u00f3 tri th\u1ee9c, th\u1ea5u hi\u1ec3u \u0111\u1ea1o l\u00fd l\u00e0m ng\u01b0\u1eddi, t\u01b0\u01a1ng lai t\u01b0\u01a1i s\u00e1ng.", "sex": 3}
