{"first_name": "D\u00e2n Tr\u00ed", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Tr\u00ed\" l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh t\u00e0i tr\u00ed, nhanh nh\u1eb9n. \"D\u00e2n\" ch\u1ec9 s\u1ef1 b\u00ecnh d\u00e2n gi\u1ea3n d\u1ecb, d\u00e2n gi\u1ea3. T\u00ean \"D\u00e2n Tr\u00ed\" mong mu\u1ed1n con th\u00f4ng minh t\u00e0i tr\u00ed, nh\u01b0ng v\u1eabn gi\u1eef \u0111\u01b0\u1ee3c v\u1ebb \u0111\u1eb9p b\u00ecnh d\u00e2n gi\u1ea3n d\u1ecb, khi\u00eam nh\u01b0\u1eddng", "sex": 5}
