{"first_name": "Gia Tr\u00ed", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t, \"Tr\u00ed\" l\u00e0 tr\u00ed kh\u00f4n, tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft; \"Gia\" l\u00e0 gia \u0111\u00ecnh, l\u00e0 m\u00e1i nh\u00e0 n\u01a1i m\u1ecdi ng\u01b0\u1eddi sum v\u1ea7y, sinh ho\u1ea1t b\u00ean nhau. Ngo\u00e0i ra ch\u1eef \"Gia\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p, \u01b0u t\u00fa, mang ph\u1ea9m ch\u1ea5t cao qu\u00fd. \"Gia Tr\u00ed\", con l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh, c\u00f3 tr\u00ed tu\u1ec7, l\u00e0 ni\u1ec1m t\u1ef1 h\u00e0o c\u1ee7a gia \u0111\u00ecnh.", "sex": 3}
{"first_name": "H\u1ea3i Tr\u00ed", "meaning": "Theo ngh\u0129a H\u00e1n, \"H\u1ea3i\" c\u00f3 ngh\u0129a l\u00e0 bi\u1ec3n, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la, th\u01b0\u1eddng g\u1ee3i h\u00ecnh \u1ea3nh m\u00eanh m\u00f4ng c\u1ee7a bi\u1ec3n c\u1ea3, m\u1ed9t c\u1ea3nh thi\u00ean nhi\u00ean kh\u00e1 quen thu\u1ed9c v\u1edbi cu\u1ed9c s\u1ed1ng con ng\u01b0\u1eddi. \"Tr\u00ed\" l\u00e0 tr\u00ed kh\u00f4n, tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft.  T\u00ean \"H\u1ea3i Tr\u00ed\" th\u1ec3 hi\u1ec7n s\u1ef1 kho\u00e1ng \u0111\u1ea1t, t\u1ef1 do, th\u00f4ng minh, tr\u00ed tu\u1ec7 nh\u01b0 bi\u1ec3n", "sex": 3}
{"first_name": "Khang Tr\u00ed", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Khang\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 s\u1ef1 y\u00ean \u1ed5n, an b\u00ecnh ho\u1eb7c \u0111\u01b0\u1ee3c d\u00f9ng khi n\u00f3i \u0111\u1ebfn s\u1ef1 gi\u00e0u c\u00f3, \u0111\u1ee7 \u0111\u1ea7y.  \"Tr\u00ed\" l\u00e0 tr\u00ed kh\u00f4n, tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft. T\u00f3m l\u1ea1i t\u00ean \"Khang Tr\u00ed\" th\u01b0\u1eddng mang h\u00e0m \u00fd t\u1ed1t \u0111\u1eb9p, ch\u1ec9 ng\u01b0\u1eddi kh\u1ecfe m\u1ea1nh, th\u00f4ng minh, ph\u00fa qu\u00fd & mong \u01b0\u1edbc cu\u1ed9c s\u1ed1ng b\u00ecnh an.", "sex": 3}
{"first_name": "Ki\u00ean Tr\u00ed", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Tr\u00ed\" l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh t\u00e0i tr\u00ed, nhanh nh\u1eb9n. \"Ki\u00ean\" l\u00e0 th\u1ec3 hi\u1ec7n s\u1ef1 v\u1eefng v\u00e0ng, b\u1ec1n v\u1eefng, trong ki\u1ebfn c\u1ed1, ki\u00ean trung, ki\u00ean \u0111\u1ecbnh, l\u00e0 nh\u1eefng t\u00ednh t\u1eeb th\u1ec3 hi\u1ec7n s\u1ef1 v\u1eefng b\u1ec1n.\"Ki\u00ean Tr\u00ed\", mong con th\u00f4ng minh, s\u00e1ng t\u1ea1o, bi\u1ebft c\u00e1ch gi\u1ea3i quy\u1ebft m\u1ecdi vi\u1ec7c nhanh ch\u00f3ng, lu\u00f4n ki\u00ean \u0111\u1ecbnh trong c\u00f4ng vi\u1ec7c.", "sex": 3}
{"first_name": "Ki\u1ec7t Tr\u00ed", "meaning": "\"Ki\u1ec7t Tr\u00ed\" l\u00e0 ng\u01b0\u1eddi ki\u1ec7t xu\u1ea5t, tr\u00ed tu\u1ec7 v\u00e0 th\u00f4ng minh.", "sex": 3}
{"first_name": "L\u00e2m Tr\u00ed", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"L\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 r\u1eebng, m\u1ed9t ngu\u1ed3n t\u00e0i nguy\u00ean qu\u00fd c\u00f3 gi\u00e1 tr\u1ecb to l\u1edbn v\u1edbi \u0111\u1eddi s\u1ed1ng. \"Tr\u00ed\" l\u00e0 tr\u00ed kh\u00f4n, tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft. T\u00ean \"L\u00e2m Tr\u00ed\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi th\u00f4ng minh, tr\u00ed tu\u1ec7, b\u00ecnh d\u1ecb, d\u1ec5 g\u1ea7n nh\u01b0 l\u1ebd t\u1ef1 nhi\u00ean nh\u01b0ng c\u0169ng m\u1ea1nh m\u1ebd & \u0111\u1ea7y uy l\u1ef1c", "sex": 3}
{"first_name": "M\u1eabn Tr\u00ed", "meaning": "\"M\u1eabn\" c\u00f3 ngh\u0129a l\u00e0 ch\u0103m ch\u1ec9, c\u1ea7n m\u1eabn si\u00eang n\u0103ng. \"Tr\u00ed\" c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, s\u00e1ng d\u1ea1, nhanh tr\u00ed. \"M\u1eabn Tr\u00ed\" mang \u00fd ngh\u0129a mong con th\u00f4ng minh, s\u00e1ng d\u1ea1, bi\u1ebft suy ngh\u0129 chu \u0111\u00e1o, t\u1ec9 m\u0129, c\u00f3 b\u1ea3n t\u00ednh ch\u0103m ch\u1ec9, si\u00eang n\u0103ng.", "sex": 3}
{"first_name": "Minh Tr\u00ed", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, c\u1ea3 t\u1eeb \"Minh\" v\u00e0 \"Tr\u00ed\" \u0111\u1ec1u mang ngh\u0129a l\u00e0 tr\u00ed kh\u00f4n, tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft. V\u00ec th\u1ebf \"Minh Tr\u00ed\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t nh\u1eb1m c\u1ea7u mong c\u00f3 m\u1ed9t tr\u00ed tu\u1ec7 tuy\u1ec7t h\u1ea3o. Mong con th\u00f4ng minh, s\u00e1ng su\u1ed1t, tr\u00ed tu\u1ec7, gi\u1ecfi giang h\u01a1n ng\u01b0\u1eddi", "sex": 3}
{"first_name": "Qu\u00e2n Tr\u00ed", "meaning": "Theo ti\u1ebfng H\u00e1n vi\u1ec7t, \"Qu\u00e2n\" c\u00f2n ch\u1ec9 l\u00e0 vua, l\u00e0 ng\u01b0\u1eddi \u0111\u1ee9ng \u0111\u1ea7u \u0111i\u1ec1u h\u00e0nh \u0111\u1ea5t n\u01b0\u1edbc,\"Tr\u00ed\" l\u00e0 tr\u00ed kh\u00f4n, tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft. Qu\u00e2n Tr\u00ed l\u00e0 n\u00f3i \u0111\u1ebfn m\u1ed9t v\u1ecb vua c\u00f3 t\u00e0i tr\u00ed, \u0111\u1ee9c \u0111\u1ed9. T\u00ean \"Qu\u00e2n Tr\u00ed\" mang \u00fd ch\u1ec9 b\u1ea3n t\u00ednh th\u00f4ng minh, \u0111a t\u00e0i, nhanh tr\u00ed, s\u1ed1 thanh nh\u00e0n, ph\u00fa qu\u00fd, d\u1ec5 th\u00e0nh c\u00f4ng, ph\u00e1t t\u00e0i, ph\u00e1t l\u1ed9c, danh l\u1ee3i song to\u00e0n.", "sex": 3}
{"first_name": "Quang Tr\u00ed", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, Quang c\u00f3 ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, \"Tr\u00ed\" l\u00e0 tr\u00ed kh\u00f4n, tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft. T\u00ean Quang Tr\u00ed d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, s\u00e1ng su\u1ed1t, c\u00f3 t\u00e0i n\u0103ng. T\u00ean Quang l\u00e0 mong mu\u1ed1n c\u1ee7a ba m\u1eb9 mu\u1ed1n con m\u00ecnh l\u00e0 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, hi\u1ec3u bi\u1ebft v\u00e0 th\u00e0nh c\u00f4ng", "sex": 3}
{"first_name": "Th\u00f4ng Tr\u00ed", "meaning": "\"Th\u00f4ng\" l\u00e0 t\u00ean m\u1ed9t lo\u1ea1i c\u00e2y h\u1ea1t tr\u1ea7n, th\u00e2n th\u1eb3ng, l\u00e1 h\u00ecnh kim, t\u00e1n l\u00e1 h\u00ecnh th\u00e1p, c\u00e2y c\u00f3 nh\u1ef1a th\u01a1m, l\u00e0 h\u00ecnh \u1ea3nh t\u01b0\u1ee3ng tr\u01b0ng trong Gi\u00e1ng sinh, mang \u00fd ngh\u0129a \u1ea5m \u00e1p v\u00e0 tr\u00e0n \u0111\u1ea7y m\u00e0u xanh hy v\u1ecdng. Ngo\u00e0i ra \"Th\u00f4ng\" c\u00f2n mang \u00fd ngh\u0129a l\u00e0 xuy\u00ean su\u1ed1t, kh\u00f4ng t\u1eafc, kh\u00f4ng b\u1ecb ng\u0103n c\u00e1ch, c\u1ea3n tr\u1edf. \"Tr\u00ed\" l\u00e0 tr\u00ed kh\u00f4n, tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft.  \u0110\u1eb7t con t\u00ean \"Th\u00f4ng\" v\u1edbi mong mu\u1ed1n con c\u00f3 tr\u00ed tu\u1ec7 th\u00f4ng su\u1ed1t, tr\u00e1i tim \u1ea5m \u00e1p, nh\u00e2n h\u1eadu, lu\u00f4n vui v\u1ebb, h\u1ed3n nhi\u00ean, l\u00e0 \u0111\u1ee9a b\u00e9 tinh nhanh, hi\u1ec3u bi\u1ebft", "sex": 3}
{"first_name": "U\u1ea9n Tr\u00ed", "meaning": "T\u00ean \"U\u1ea9n Tr\u00ed\"c\u00f3 s\u1ee9c g\u1ee3i m\u1edf l\u1edbn, mang \u00fd ngh\u0129a l\u00e0 kh\u00f4ng c\u00f3 b\u1ea5t c\u1ee9 gi\u1edbi h\u1ea1n n\u00e0o, \u00fd mong con lu\u00f4n \u0111\u1ee7 \u0111\u1ea7y t\u01b0 duy logoc v\u00e0 s\u00e1ng t\u1ea1o.", "sex": 3}
{"first_name": "Uy Tr\u00ed", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Tr\u00ed\" l\u00e0 tr\u00ed kh\u00f4n, tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft. T\u00ean \"Tr\u00ed\" l\u00e0 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, tr\u00ed tu\u1ec7, t\u00e0i gi\u1ecfi. \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd.  S\u1ef1 k\u1ebft h\u1ee3p t\u1ea1o ra t\u00ean \"Uy Tr\u00ed\", cha m\u1eb9 mong con l\u00e0 \u0111\u1ee9a con c\u00f3 tri th\u1ee9c, th\u1ea5u hi\u1ec3u \u0111\u1ea1o l\u00fd l\u00e0m ng\u01b0\u1eddi, t\u01b0\u01a1ng lai t\u01b0\u01a1i s\u00e1ng.", "sex": 3}
{"first_name": "Quang Tri\u1ec7t", "meaning": "\"Quang\" l\u00e0 \u00e1nh s\u00e1ng. \"Quang Tri\u1ec7t\" l\u00e0 ng\u01b0\u1eddi th\u1ea5u su\u1ed1t v\u1ea5n \u0111\u1ec1, tr\u00ed tu\u1ec7 h\u01a1n ng\u01b0\u1eddi.", "sex": 3}
{"first_name": "C\u01b0\u1eddng Tr\u00ed\u00a0", "meaning": "\"Tr\u00ed\" l\u00e0 tr\u00ed kh\u00f4n, tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft v\u00e0 \"C\u01b0\u1eddng\" theo ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 l\u1ef1c l\u01b0\u1ee1ng, uy l\u1ef1c v\u1edbi ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i v\u1ec1 th\u1ec3 ch\u1ea5t, m\u1ea1nh kh\u1ecfe tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. \"C\u01b0\u1eddng Tr\u00ed\" l\u00e0 t\u00ean th\u01b0\u1eddng \u0111\u1eb7t cho c\u00e1c b\u00e9 trai \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, tr\u00ed tu\u1ec7, t\u00e0i gi\u1ecfi, c\u00f3 tri th\u1ee9c, th\u1ea5u hi\u1ec3u \u0111\u1ea1o l\u00fd l\u00e0m ng\u01b0\u1eddi, t\u01b0\u01a1ng lai t\u01b0\u01a1i s\u00e1ng.", "sex": 3}
{"first_name": "Ho\u00e0ng Tri\u1ebft", "meaning": "\"Ho\u00e0ng\" trong ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 m\u00e0u v\u00e0ng, \u00e1nh s\u1eafc c\u1ee7a v\u00e0ng v\u00e0 \u1edf m\u1ed9t ngh\u0129a kh\u00e1c th\u00ec \"Ho\u00e0ng\" th\u1ec3 hi\u1ec7n s\u1ef1 nghi\u00eam trang, r\u1ef1c r\u1ee1, huy ho\u00e0ng nh\u01b0 b\u1eadc vua ch\u00faa. T\u00ean \"Ho\u00e0ng Tri\u1ebft\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi v\u0129 \u0111\u1ea1i, t\u00e0i ba, c\u00f3 c\u1ed1t c\u00e1ch v\u01b0\u01a1ng gi\u1ea3, v\u1edbi mong mu\u1ed1n t\u01b0\u01a1ng lai ph\u00fa qu\u00fd, sang gi\u00e0u", "sex": 3}
{"first_name": "Kh\u01b0\u01a1ng Tri\u1ebft", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Khang\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 s\u1ef1 y\u00ean \u1ed5n, an b\u00ecnh ho\u1eb7c \u0111\u01b0\u1ee3c d\u00f9ng khi n\u00f3i \u0111\u1ebfn s\u1ef1 gi\u00e0u c\u00f3, \u0111\u1ee7 \u0111\u1ea7y. \"Tri\u1ebft\" c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, s\u00e1ng su\u1ed1t, l\u00e0 ng\u01b0\u1eddi hi\u1ec1n t\u00e0i, c\u00f3 t\u00e0i n\u0103ng. V\u00ec v\u1eady, t\u00ean \"Khang Tri\u1ebft\" mang h\u00e0m \u00fd t\u1ed1t \u0111\u1eb9p, ch\u1ec9 ng\u01b0\u1eddi kh\u1ecfe m\u1ea1nh, th\u00f4ng minh, ph\u00fa qu\u00fd & mong \u01b0\u1edbc cu\u1ed9c s\u1ed1ng b\u00ecnh an.", "sex": 3}
{"first_name": "Minh Tri\u1ebft", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Minh\" ngh\u0129a l\u00e0 th\u00f4ng minh, s\u00e1ng su\u1ed1t, minh m\u1eabn, \"Tri\u1ebft\" l\u00e0 s\u1ef1 hi\u1ec3u bi\u1ebft s\u00e2u s\u1eafc v\u1ec1 b\u1ea3n ch\u1ea5t c\u1ee7a s\u1ef1 v\u1eadt, hi\u1ec7n t\u01b0\u1ee3ng v\u00e0 \u0111\u1ea1o l\u00fd (VD: tri\u1ebft l\u00fd, tri\u1ebft h\u1ecdc...). \"Minh Tri\u1ebft \" c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh v\u00e0 hi\u1ec3u bi\u1ebft s\u00e2u r\u1ed9ng. \u0110\u1eb7t t\u00ean con l\u00e0 Minh Tri\u1ebft c\u00f3 ngh\u0129a l\u00e0 mong con s\u1ebd lu\u00f4n th\u00f4ng minh, s\u00e1ng su\u1ed1t, bi\u1ebft nh\u00ecn xa tr\u00f4ng r\u1ed9ng v\u00e0 hi\u1ec3u bi\u1ebft th\u1eddi th\u1ebf \u0111\u1ec3 c\u00f3 th\u1ec3 n\u1eafm b\u1eaft \u0111\u01b0\u1ee3c nh\u1eefng c\u01a1 h\u1ed9i th\u00e0nh c\u00f4ng trong cu\u1ed9c s\u1ed1ng.", "sex": 3}
{"first_name": "Nam Tri\u1ebft", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Tri\u1ebft d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, s\u00e1ng su\u1ed1t, l\u00e0 ng\u01b0\u1eddi hi\u1ec1n t\u00e0i, c\u00f3 t\u00e0i n\u0103ng", "sex": 3}
{"first_name": "Nh\u1eadt Tri\u1ebft", "meaning": "\"Nh\u1eadt\" theo ngh\u0129a ti\u1ebfng H\u00e1n c\u00f3 ngh\u0129a l\u00e0 m\u1eb7t tr\u1eddi, d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7, th\u00f4ng minh, t\u00e0i tr\u00ed, ngo\u00e0i ra c\u00f2n c\u00f3 ngh\u0129a l\u00e0 ch\u1ee7 nh\u1eadt, th\u1ec3 hi\u1ec7n s\u1ef1 b\u00ecnh y\u00ean, th\u01b0 th\u00e1i. T\u00ean \"Nh\u1eadt Tri\u1ebft\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi c\u00f3 h\u1ecdc th\u1ee9c, l\u00e0 hi\u1ec1n t\u00e0i c\u1ee7a \u0111\u1ea5t n\u01b0\u1edbc, b\u00ean c\u1ea1nh \u0111\u00f3 lu\u00f4n c\u00f3 phong th\u00e1i \u0111i\u1ec1m \u0111\u1ea1m, b\u00ecnh t\u0129nh trong gi\u1ea3i quy\u1ebft v\u1ea5n \u0111\u1ec1", "sex": 3}
{"first_name": "H\u01b0\u01a1ng Tranh", "meaning": "\"H\u01b0\u01a1ng\" l\u00e0 m\u00f9i th\u01a1m. \"H\u01b0\u01a1ng Tranh\" l\u00e0 chi\u1ebfm gi\u1eef h\u01b0\u01a1ng th\u01a1m, ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i b\u1ea3n l\u0129nh quy\u1ebft \u0111o\u00e1n, ki\u1ec1u di\u1ec5m \u0111\u1eb9p xinh.", "sex": 5}
{"first_name": "Long Tr\u1eadn", "meaning": "\"Long\" l\u00e0 r\u1ed3ng. \"Long Tr\u1eadn\" l\u00e0 d\u00e1ng th\u1ec3 c\u1ee7a r\u1ed3ng, ch\u1ec9 con ng\u01b0\u1eddi c\u00f3 ph\u1ea9m ch\u1ea5t cao qu\u00fd, phong th\u00e1i h\u01a1n ng\u01b0\u1eddi.", "sex": 3}
{"first_name": "A Trinh", "meaning": "\"Trinh\" l\u00e0 tinh khi\u1ebft. \"A Trinh\" ngh\u0129a mong con trong s\u00e1ng, \u0111\u00e1ng y\u00eau.", "sex": 5}
