{"first_name": "Di\u1ec5m Trinh", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"Di\u1ec5m\" l\u00e0 m\u1ed9t th\u1ee9 ng\u1ecdc \u0111\u1eb9p, hay d\u00f9ng \u0111\u1ec3 g\u1ecdi m\u1ed9t c\u00f4 g\u00e1i \u0111\u1eb9p r\u1ea1ng ng\u1eddi. T\u00ean \"Di\u1ec5m Trinh\" l\u00e0 c\u00e1i t\u00ean th\u00f9y m\u1ecb, \u0111\u00e1ng y\u00eau d\u00e0nh cho con g\u00e1i v\u1edbi \u01b0\u1edbc mong v\u1ec1 m\u1ed9t v\u1ebb \u0111\u1eb9p ki\u00eau sa, m\u1ed9c m\u1ea1c, \u0111\u1ee9c h\u1ea1nh, ngay th\u1eb3ng, th\u1eadt th\u00e0.", "sex": 5}
{"first_name": "Ki\u1ec1u Trinh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ki\u1ec1u\" d\u00f9ng \u0111\u1ec3 g\u1ee3i \u0111\u1ebfn d\u00e1ng d\u1ea5p m\u1ec1m m\u1ea1i \u0111\u00e1ng y\u00eau, con g\u00e1i \u0111\u1eb9p. T\u00ean \"Ki\u1ec1u Trinh\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, \u0111\u00e1ng y\u00eau, t\u00e2m h\u1ed3n trong s\u00e1ng, th\u1ee7y chung, ngay th\u1eb3ng", "sex": 5}
{"first_name": "Lan Trinh", "meaning": "Theo ngh\u0129a H\u00e1n -Vi\u1ec7t, \"Lan\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa qu\u00fd, t\u1ecfa ng\u00e1t h\u01b0\u01a1ng th\u01a1m, \"Trinh\" l\u00e0 ti\u1ebft h\u1ea1nh, ngay th\u1eb3ng, trung th\u00e0nh, kh\u1eb3ng kh\u00e1i. T\u00ean \"Lan Trinh\" l\u00e0 m\u1ed9t c\u00e1i t\u00ean tinh t\u1ebf \u0111\u1ec3 \u0111\u1eb7t cho con g\u00e1i, v\u1edbi mong mu\u1ed1n con \u0111\u01b0\u1ee3c xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, qu\u00fd ph\u00e1i nh\u01b0 \u0111\u00f3a hoa lan, t\u00ednh t\u00ecnh ngay th\u1eb3ng, trung th\u1ef1c, th\u1ee7y chung.", "sex": 5}
{"first_name": "Ng\u1ecdc Trinh", "meaning": "\"Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh. \"Trinh\" l\u00e0 ti\u1ebft h\u1ea1nh, trong s\u00e1ng, th\u1ee7y chung. T\u00ean \"Ng\u1ecdc Trinh\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u1ecfa s\u00e1ng nh\u01b0 ng\u1ecdc qu\u00fd, t\u00e2m h\u1ed3n trong s\u00e1ng, thu\u1ea7n khi\u1ebft v\u00e0 c\u00f3 \u0111\u1ee9c h\u1ea1nh.", "sex": 5}
{"first_name": "Nguy\u1ec7t Trinh", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, nguy\u1ec7t l\u00e0 v\u1ea7ng tr\u0103ng, Tr\u0103ng c\u00f3 v\u1ebb \u0111\u1eb9p v\u00f4 c\u00f9ng b\u00ecnh d\u1ecb, m\u1ed9t v\u1ebb \u0111\u1eb9p kh\u00f4ng c\u1ea7n trang s\u1ee9c, \u0111\u1eb9p m\u1ed9t c\u00e1ch v\u00f4 t\u01b0, h\u1ed3n nhi\u00ean. Tr\u0103ng t\u01b0\u1ee3ng tr\u01b0ng cho v\u1ebb \u0111\u1eb9p h\u1ed3n nhi\u00ean n\u00ean tr\u0103ng ho\u00e0 v\u00e0o thi\u00ean nhi\u00ean, ho\u00e0 v\u00e0o c\u00e2y c\u1ecf. \u0110\u1eb7t t\u00ean Nguy\u1ec7t Trinh l\u00e0 b\u1ed1 m\u1eb9 mong mu\u1ed1n con s\u1ebd xinh \u0111\u1eb9p, gi\u1ea3n d\u1ecb, s\u1ed1ng chung th\u1ee7y, gi\u1eef \u0111\u1ea1o h\u1ea1nh", "sex": 5}
{"first_name": "Nh\u00e3 Trinh", "meaning": "\"Nh\u00e3\" l\u00e0 nh\u00e3 nh\u1eb7n, b\u00ecnh d\u1ecb. \"Trinh\" l\u00e0 ti\u1ebft h\u1ea1nh, g\u1ee3i \u0111\u1ebfn ng\u01b0\u1eddi \u0111\u1ee9c h\u1ea1nh, th\u1ee7y chung. T\u00ean \"Nh\u00e3 Trinh\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i c\u00f4ng dung ng\u00f4n h\u1ea1nh, hi\u1ec1n l\u00e0nh, d\u1ecbu d\u00e0ng, m\u1ed9c m\u1ea1c, b\u00ecnh d\u1ecb", "sex": 5}
{"first_name": "Ph\u01b0\u01a1ng Trinh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ph\u01b0\u01a1ng\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ph\u01b0\u01a1ng h\u01b0\u1edbng, \"Trinh\" l\u00e0 ti\u1ebft h\u1ea1nh. \"Ph\u01b0\u01a1ng Trinh\" l\u00e0 s\u1ef1 k\u1ebft h\u1ee3p ho\u00e0n h\u1ea3o nh\u1eb1m kh\u1eafc h\u1ecda m\u1ed9t s\u1ef1 r\u00f5 r\u00e0ng, c\u00f3 ch\u1ee7 ki\u1ebfn, bi\u1ebft x\u00e1c \u0111\u1ecbnh \u0111\u01b0\u1ee3c vi\u1ec7c t\u1ed1t x\u1ea5u. T\u00ean \"Ph\u01b0\u01a1ng Trinh\" khi\u1ebfn ch\u00fang ta h\u00ecnh dung \u0111\u1ebfn m\u1ed9t ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, c\u00f3 ph\u1ea9m ch\u1ea5t, \u0111\u1ee9c h\u1ea1nh, c\u00f3 b\u1ea3n l\u0129nh, \u00fd ch\u00ed, c\u00f3 ch\u1ee7 ki\u1ebfn.", "sex": 5}
