{"first_name": "Vi\u1ec7t Trinh", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Vi\u1ec7t\" c\u00f3 ngh\u0129a l\u00e0 b\u00f3ng r\u1ee3p c\u1ee7a c\u00e2y, \u00fd n\u00f3i \u0111\u1ebfn b\u00f3ng m\u00e1t, \u0111\u01b0\u1ee3c ch\u1edf che, bao b\u1ecdc, \"Trinh\" c\u00f3 ngh\u0129a l\u00e0 ti\u1ebft h\u1ea1nh, th\u1ee7y chung. T\u00ean \"Vi\u1ec7t Trinh\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, c\u00f4ng dung ng\u00f4n h\u1ea1nh, th\u1ee7y chung, son s\u1eafc, ngay th\u1eb3ng, kh\u1eb3ng kh\u00e1i, lu\u00f4n \u0111\u01b0\u1ee3c y\u00eau th\u01b0\u01a1ng, bao b\u1ecdc, g\u1eb7p nhi\u1ec1u \u0111i\u1ec1u t\u1ed1t l\u00e0nh.", "sex": 5}
