{"first_name": "Gi\u00e1c Tr\u1ecdng", "meaning": "\"Tr\u1ecdng\" l\u00e0 xung y\u1ebfu. \"Gi\u00e1c Tr\u1ecdng\" c\u00f3 ngh\u0129a l\u00e0 v\u1ecb tr\u00ed xung y\u1ebfu, th\u1ec3 hi\u1ec7n \u01b0\u1edbc mong cha m\u1eb9 sau n\u00e0y con s\u1ebd c\u1ee9ng c\u00e1p m\u1ea1nh m\u1ebd, ki\u00ean \u0111\u1ecbnh trong cu\u1ed9c \u0111\u1eddi.", "sex": 3}
