{"first_name": "Kh\u1ea3i Tr\u1ecdng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Tr\u1ecdng\" ngh\u0129a l\u00e0 t\u00f4n tr\u1ecdng, th\u1ec3 hi\u1ec7n s\u1ef1 n\u1ec3 ph\u1ee5c, t\u00f4n k\u00ednh. \"Kh\u1ea3i\" l\u00e0 kh\u00fac ca vui v\u1ebb, th\u1ec3 hi\u1ec7n ni\u1ec1m vui, s\u1ef1 chi\u1ebfn th\u1eafng. T\u00ean \"Kh\u1ea3i Tr\u1ecdng\" \u00fd mong mu\u1ed1n con lu\u00f4n c\u00f3 \u0111\u01b0\u1ee3c th\u00e0nh c\u00f4ng, c\u00f4ng danh r\u1ea1ng r\u1ee1, v\u1ebb vang, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi n\u1ec3 ph\u1ee5c.", "sex": 3}
{"first_name": "Khi\u00ean Tr\u1ecdng", "meaning": "\"Tr\u1ecdng\" l\u00e0 n\u1eb7ng. \"Khi\u00ean Tr\u1ecdng\" ngh\u0129a l\u00e0 t\u1ea5m khi\u00ean n\u1eb7ng, th\u1ec3 hi\u1ec7n t\u1ea7m v\u00f3c con ng\u01b0\u1eddi to l\u1edbn, c\u00f3 kh\u1ea3 n\u0103ng qu\u00e1n xuy\u1ebfn lo l\u1eafng.", "sex": 3}
{"first_name": "Khoa Tr\u1ecdng", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t, \"Tr\u1ecdng\" ngh\u0129a l\u00e0 t\u00f4n tr\u1ecdng, th\u1ec3 hi\u1ec7n s\u1ef1 n\u1ec3 ph\u1ee5c, t\u00f4n k\u00ednh. \"Khoa\" th\u01b0\u1eddng mang h\u00e0m \u00fd t\u1ed1t \u0111\u1eb9p, ch\u1ec9 s\u1ef1 vi\u1ec7c to l\u1edbn, d\u00f9ng \u0111\u1ec3 n\u00f3i v\u1ec1 ng\u01b0\u1eddi c\u00f3 \u0111\u1ecba v\u1ecb x\u00e3 h\u1ed9i, tr\u00ecnh \u0111\u1ed9 h\u1ecdc v\u1ea5n. Theo v\u0103n h\u00f3a c\u1ee7a ng\u01b0\u1eddi x\u01b0a, c\u00e1c \u0111\u1ea5ng nam nhi th\u01b0\u1eddng l\u1ea5y c\u00f4ng danh \u0111\u1ed7 \u0111\u1ea1t l\u00e0m \u0111\u1ea7u n\u00ean t\u00ean \"Khoa\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 mong mu\u1ed1n con c\u00e1i sau n\u00e0y t\u00e0i n\u0103ng, th\u00f4ng minh, ham h\u1ecdc h\u1ecfi, s\u1edbm \u0111\u1ed7 \u0111\u1ea1t th\u00e0nh danh.\"Khoa Tr\u1ecdng\", ba m\u1eb9 mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh t\u00e0i gi\u1ecfi \u0111\u1ea1t \u0111\u01b0\u1ee3c nhi\u1ec1u th\u00e0nh c\u00f4ng trong cu\u1ed9c s\u1ed1ng v\u00e0 \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi n\u1ec3 tr\u1ecdng.", "sex": 3}
{"first_name": "Ki\u1ebfm Tr\u1ecdng", "meaning": "\"Tr\u1ecdng\" l\u00e0 n\u1eb7ng. \"Ki\u1ebfm Tr\u1ecdng\" l\u00e0 c\u00e2y ki\u1ebfm l\u1edbn, ch\u1ec9 con ng\u01b0\u1eddi lu\u00f4n tr\u00e1ch nhi\u1ec7m quy\u1ebft \u0111o\u00e1n, t\u00e0i n\u0103ng \u0111\u1ea7y b\u1ea3n l\u0129nh.", "sex": 3}
