{"first_name": "M\u1eabn Tr\u1ecdng", "meaning": "\"M\u1eabn\" c\u00f3 ngh\u0129a l\u00e0 minh m\u1eabn, s\u00e1ng su\u1ed1t hay c\u00f2n \u0111\u01b0\u1ee3c hi\u1ec3u l\u00e0 ch\u0103m ch\u1ec9, c\u1ea7n m\u1eabn. Tr\u1ecdng c\u00f3 ngh\u0129a l\u00e0 con bi\u1ebft k\u00ednh tr\u1ecdng, bi\u1ebft y\u00eau th\u01b0\u01a1ng m\u1ecdi ng\u01b0\u1eddi. V\u1edbi t\u00ean \"M\u1eabn Tr\u1ecdng\", cha m\u1eb9 mong con c\u1ea3 cu\u1ed9c \u0111\u1eddi t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, s\u1ed1ng c\u00f3 tr\u01b0\u1edbc c\u00f3 sau, kh\u00f4ng ph\u1ee5 c\u00f4ng \u01a1n ng\u01b0\u1eddi kh\u00e1c, bi\u1ebft k\u00ednh tr\u1ecdng \u00f4ng b\u00e0 cha m\u1eb9, hi\u1ebfu thu\u1eadn v\u00e0 l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh, t\u00e0i ba, s\u00e1ng su\u1ed1t trong c\u00e1ch nh\u00ecn ng\u01b0\u1eddi nh\u00ecn vi\u1ec7c.", "sex": 3}
{"first_name": "Mi\u00ean Tr\u1ecdng", "meaning": "\"Mi\u00ean\" l\u00e0 tri\u1ec1n mi\u00ean kh\u00f4ng d\u1ee9t. \"Tr\u1ecdng\" c\u00f3 ngh\u0129a l\u00e0 con bi\u1ebft k\u00ednh tr\u1ecdng, bi\u1ebft y\u00eau th\u01b0\u01a1ng m\u1ecdi ng\u01b0\u1eddi. \"Mi\u00ean Tr\u1ecdng\" \u00fd n\u00f3i cha m\u1eb9 mong con c\u1ea3 cu\u1ed9c \u0111\u1eddi t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, s\u1ed1ng c\u00f3 tr\u01b0\u1edbc c\u00f3 sau, kh\u00f4ng ph\u1ee5 r\u00e3y c\u00f4ng \u01a1n ng\u01b0\u1eddi kh\u00e1c, bi\u1ebft k\u00ednh tr\u1ecdng \u00f4ng b\u00e0 cha m\u1eb9, hi\u1ebfu thu\u1eadn c\u1ea3 \u0111\u1eddi.", "sex": 3}
{"first_name": "Minh Tr\u1ecdng", "meaning": "\"Minh\" l\u00e0 hi\u1ec3u bi\u1ebft, th\u00f4ng minh, s\u00e1ng su\u1ed1t, \"Tr\u1ecdng\" l\u00e0 ng\u01b0\u1eddi bi\u1ebft qu\u00fd tr\u1ecdng l\u1ebd ph\u1ea3i, s\u1ed1ng \u0111\u1ea1o l\u00fd, \u0111\u1ee9ng \u0111\u1eafn, lu\u00f4n ch\u1ecdn con \u0111\u01b0\u1eddng ngay th\u1eb3ng. T\u00ean \"Minh Tr\u1ecdng\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi \u00fd ngh\u0129a con s\u1ebd l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh, hi\u1ec3u bi\u1ebft, s\u1ed1ng c\u00f3 \u0111\u1ea1o l\u00fd, c\u00f3 m\u1ee5c \u0111\u00edch", "sex": 3}
{"first_name": "M\u1ed9c Tr\u1ecdng", "meaning": "\"M\u1ed9c\" l\u00e0 ch\u1ea5t ph\u00e1c, ch\u00e2n th\u1eadt, m\u1ed9c m\u1ea1c. \"Tr\u1ecdng\" l\u00e0 th\u1ec3 hi\u1ec7n s\u1ef1 k\u00ednh n\u1ec3, bi\u1ebft ghi kh\u1eafc nh\u1eefng t\u00ecnh c\u1ea3m v\u00e0 c\u00f4ng lao to l\u1edbn c\u1ee7a ng\u01b0\u1eddi kh\u00e1c d\u00e0nh cho m\u00ecnh. \"M\u1ed9c Tr\u1ecdng\" mang \u00fd ngh\u0129a con bi\u1ebft s\u1ed1ng ch\u00e2n th\u1eadt, b\u00ecnh d\u1ecb, hi\u1ec1n h\u00f2a v\u00e0 bi\u1ebft k\u00ednh tr\u1ecdng cha m\u1eb9, \u00f4ng b\u00e0.", "sex": 3}
{"first_name": "M\u1ef9 Tr\u1ecdng", "meaning": "\"M\u1ef9\" c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p, t\u1ed1t l\u00e0nh. \"Tr\u1ecdng\" l\u00e0 ng\u01b0\u1eddi bi\u1ebft qu\u00fd tr\u1ecdng l\u1ebd ph\u1ea3i, s\u1ed1ng \u0111\u1ea1o l\u00fd, \u0111\u1ee9ng \u0111\u1eafn. \"M\u1ef9 Tr\u1ecdng\" ngh\u0129a l\u00e0 con bi\u1ebft tr\u00e2n tr\u1ecdng c\u00e1i \u0111\u1eb9p c\u1ee7a cu\u1ed9c \u0111\u1eddi, s\u1ed1ng theo l\u1ebd ph\u1ea3i.", "sex": 5}
{"first_name": "Nam Tr\u1ecdng", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Tr\u1ecdng th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi c\u00f3 c\u1ed1t c\u00e1ch thanh cao, nghi\u00eam t\u00fac, s\u1ed1ng c\u00f3 \u0111\u1ea1o l\u00fd, c\u00f3 t\u00ecnh ngh\u0129a, \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi n\u1ec3 tr\u1ecdng", "sex": 3}
{"first_name": "Ngh\u00ea Tr\u1ecdng", "meaning": "\"Tr\u1ecdng\" l\u00e0 s\u1ee9c n\u1eb7ng. \"Ngh\u00ea Tr\u1ecdng\" l\u00e0 \u0111\u1ea7u m\u1ed1i quan tr\u1ecdng, th\u1ec3 hi\u1ec7n ni\u1ec1m tin y\u00eau, cha m\u1eb9 xem con nh\u01b0 kh\u1edfi ngu\u1ed3n nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p.", "sex": 3}
{"first_name": "Ngh\u0129a Tr\u1ecdng", "meaning": "\"Ngh\u0129a Tr\u1ecdng\", con l\u00e0 ng\u01b0\u1eddi bi\u1ebft qu\u00fd tr\u1ecdng l\u1ebd ph\u1ea3i, s\u1ed1ng \u0111\u1ea1o l\u00fd, \u0111\u1ee9ng \u0111\u1eafn, lu\u00f4n ch\u1ecdn con \u0111\u01b0\u1eddng ngay th\u1eb3ng.", "sex": 3}
