{"first_name": "Ph\u01b0\u01a1ng Tr\u1ecdng", "meaning": "Theo ngh\u0129a ti\u1ebfng H\u00e1n, \"Ph\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 ph\u01b0\u01a1ng h\u01b0\u1edbng, \"Tr\u1ecdng\" l\u00e0 ng\u01b0\u1eddi bi\u1ebft qu\u00fd tr\u1ecdng l\u1ebd ph\u1ea3i, s\u1ed1ng \u0111\u1ea1o l\u00fd, \u0111\u1ee9ng \u0111\u1eafn, lu\u00f4n ch\u1ecdn con \u0111\u01b0\u1eddng ngay th\u1eb3ng. T\u00ean \"Ph\u01b0\u01a1ng Tr\u1ecdng\" nh\u1eb1m n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi hi\u1ec3u bi\u1ebft, s\u1ed1ng c\u00f3 nh\u00e2n ngh\u0129a, c\u00f3 ch\u00ed h\u01b0\u1edbng r\u00f5 r\u00e0ng", "sex": 3}
{"first_name": "Sam Tr\u1ecdng", "meaning": "\"Tr\u1ecdng\" l\u00e0 ng\u01b0\u1eddi bi\u1ebft qu\u00fd tr\u1ecdng l\u1ebd ph\u1ea3i, s\u1ed1ng \u0111\u1ea1o l\u00fd, \u0111\u1ee9ng \u0111\u1eafn, lu\u00f4n ch\u1ecdn con \u0111\u01b0\u1eddng ngay th\u1eb3ng. Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Sam\" c\u00f3 ngh\u0129a l\u00e0 s\u1eafc, b\u00e9n, nh\u1ecdn. Ngo\u00e0i ra \"Sam\" c\u00f2n l\u00e0 t\u00ean m\u1ed9t lo\u00e0i \u0111\u1ed9ng v\u1eadt ch\u00e2n \u0111\u1ed1t \u1edf bi\u1ec3n t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 th\u1ee7y chung, son s\u1eafc, s\u1ed1ng c\u00f3 t\u00ecnh c\u00f3 ngh\u0129a. Ng\u01b0\u1eddi t\u00ean \"Sam Tr\u1ecdng\" th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh, s\u1eafc s\u1ea3o, s\u1ed1ng kh\u00f4n kh\u00e9o, hi\u1ec3u bi\u1ebft, c\u00f3 c\u1ed1t c\u00e1ch thanh cao, nghi\u00eam t\u00fac, s\u1ed1ng c\u00f3 \u0111\u1ea1o l\u00fd, th\u1ee7y chung, c\u00f3 t\u00ecnh ngh\u0129a.", "sex": 3}
{"first_name": "S\u00e2m Tr\u1ecdng", "meaning": "\"Tr\u1ecdng\" l\u00e0 ng\u01b0\u1eddi bi\u1ebft qu\u00fd tr\u1ecdng l\u1ebd ph\u1ea3i, s\u1ed1ng \u0111\u1ea1o l\u00fd, \u0111\u1ee9ng \u0111\u1eafn, lu\u00f4n ch\u1ecdn con \u0111\u01b0\u1eddng ngay th\u1eb3ng. Theo ngh\u0129a H\u00e1n-Vi\u1ec7t, \"S\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ed3 qu\u00fd b\u00e1u, tr\u00e2n b\u1ea3o, ngo\u00e0i ra c\u00f2n l\u00e0 t\u00ean c\u1ee7a m\u1ed9t lo\u1ea1i c\u1ecf s\u00e2m, l\u00e1 nh\u01b0 c\u00e1i b\u00e0n tay, hoa nh\u1ecf m\u00e0 tr\u1eafng, d\u00f9ng l\u00e0m thu\u1ed1c. T\u00ean \"S\u00e2m Tr\u1ecdng\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u00e0i n\u0103ng c\u00f3 th\u1ec3 gi\u00fap \u00edch cho ng\u01b0\u1eddi cho \u0111\u1eddi nh\u01b0 lo\u00e0i s\u00e2m qu\u00fd \u1ea5y, mong con c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng b\u00ecnh an, vinh hoa, ph\u00fa qu\u00fd, c\u00f3 c\u1ed1t c\u00e1ch thanh cao, nghi\u00eam t\u00fac, s\u1ed1ng c\u00f3 \u0111\u1ea1o l\u00fd, c\u00f3 t\u00ecnh ngh\u0129a.", "sex": 3}
{"first_name": "Sang Tr\u1ecdng", "meaning": "\"Tr\u1ecdng\" l\u00e0 ng\u01b0\u1eddi bi\u1ebft qu\u00fd tr\u1ecdng l\u1ebd ph\u1ea3i, s\u1ed1ng \u0111\u1ea1o l\u00fd, \u0111\u1ee9ng \u0111\u1eafn, lu\u00f4n ch\u1ecdn con \u0111\u01b0\u1eddng ngay th\u1eb3ng. Ng\u01b0\u1eddi t\u00ean \"Sang Tr\u1ecdng\" th\u01b0\u1eddng c\u00f3 c\u1ed1t c\u00e1ch thanh cao, nghi\u00eam t\u00fac, s\u1ed1ng c\u00f3 \u0111\u1ea1o l\u00fd, c\u00f3 t\u00ecnh ngh\u0129a, \u0111\u01b0\u1ee3c k\u00ednh tr\u1ecdng, n\u1ec3 nang.", "sex": 3}
{"first_name": "Si\u00eau Tr\u1ecdng", "meaning": "\"Tr\u1ecdng\" l\u00e0 n\u1eb7ng. \"Si\u00eau Tr\u1ecdng\" l\u00e0 h\u00e0nh \u0111\u1ed9ng quan tr\u1ecdng, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi c\u00f3 t\u00e0i c\u00e1n \u0111\u1eb7c bi\u1ec7t, h\u00e0nh \u0111\u1ed9ng h\u01a1n ng\u01b0\u1eddi.", "sex": 3}
{"first_name": "Thanh Tr\u1ecdng", "meaning": "\"Thanh\" l\u00e0 trong s\u1ea1ch, li\u00eam khi\u1ebft. \"Tr\u1ecdng\" l\u00e0 ng\u01b0\u1eddi bi\u1ebft qu\u00fd tr\u1ecdng l\u1ebd ph\u1ea3i, s\u1ed1ng \u0111\u1ea1o l\u00fd, \u0111\u1ee9ng \u0111\u1eafn, lu\u00f4n ch\u1ecdn con \u0111\u01b0\u1eddng ngay th\u1eb3ng. T\u00ean \"Thanh Tr\u1ecdng\" mang \u00fd ngh\u0129a v\u1ec1 ng\u01b0\u1eddi s\u1ed1ng c\u00f3 \u0111\u1ea1o l\u00fd, \u0111\u1ee9ng \u0111\u1eafng, trong s\u1ea1ch, thanh cao", "sex": 3}
{"first_name": "Th\u00e0nh Tr\u1ecdng", "meaning": "Ch\u1eef  \"Th\u00e0nh\" theo ngh\u0129a  H\u00e1n-Vi\u1ec7t d\u00f9ng \u0111\u1ec3 ch\u1ec9 t\u01b0\u1eddng l\u1edbn bao quanh kinh \u0111\u00f4 ho\u1eb7c m\u1ed9t khu v\u1ef1c \u0111\u1ec3 ph\u00f2ng v\u1ec7 . T\u00ean \"Th\u00e0nh Tr\u1ecdng\" nh\u1eb1m n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi c\u00f3 th\u1ec3 ch\u1ea5t kh\u1ecfe m\u1ea1nh, suy ngh\u0129 quy\u1ebft \u0111o\u00e1n, r\u1ea5t v\u1eefng ch\u1eafc trong suy ngh\u0129 v\u00e0 h\u00e0nh \u0111\u1ed9ng", "sex": 3}
{"first_name": "Y\u1ebfn Tr\u1ecdng", "meaning": "\"Tr\u1ecdng\" l\u00e0 ng\u01b0\u1eddi c\u00f3 c\u1ed1t c\u00e1ch thanh cao, nghi\u00eam t\u00fac, s\u1ed1ng c\u00f3 \u0111\u1ea1o l\u00fd. \"Y\u1ebfn Tr\u1ecdng\" l\u00e0 c\u00e1i t\u00ean th\u1ec3 hi\u1ec7n mong mu\u1ed1n con v\u1eeba l\u00e0 ng\u01b0\u1eddi gi\u1ecfi giang xinh \u0111\u1eb9p v\u1eeba l\u00e0 ng\u01b0\u1eddi c\u00f3 cu\u1ed9c s\u1ed1ng vui v\u1ebb thanh tao.", "sex": 5}
{"first_name": "Minh Tr\u1ee3", "meaning": "\"Minh Tr\u1ee3\" l\u00e0 c\u00f4ng khai gi\u00fap \u0111\u1ee1, ch\u1ec9 con ng\u01b0\u1eddi c\u00f4ng t\u00e2m ch\u00ednh ngh\u0129a, c\u00f3 tr\u00e1ch nhi\u1ec7m c\u1ed9ng \u0111\u1ed3ng.", "sex": 3}
{"first_name": "An Tr\u00fac", "meaning": "\"An\" theo ngh\u0129a H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 nh\u1eb9 nh\u00e0ng, an l\u00e0nh, y\u00ean b\u00ecnh gi\u1ed1ng nh\u01b0 ch\u00ednh b\u1ed9 ch\u1eef vi\u1ebft ra n\u00f3, \"Tr\u00fac\" l\u00e0 c\u00e2y thu\u1ed9c h\u1ecd tre, th\u00e2n th\u1eb3ng, c\u00f3 m\u00e0u v\u00e0ng c\u00f3 nhi\u1ec1u \u0111\u1ed1t, b\u00ean trong ru\u1ed9t r\u1ed7ng, l\u00e1 nh\u1ecdn m\u1ecdc th\u00e0nh t\u1eebng ch\u00f9m \u1edf g\u1ea7n ng\u1ecdn c\u00e2y. Tr\u00fac thu\u1ed9c b\u1ed9 t\u1ee9 qu\u00fd \"T\u00f9ng, c\u00fac, Tr\u00fac, Mai\" l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a ng\u01b0\u1eddi qu\u00e2n t\u1eed, s\u1ef1 thanh cao, ngay th\u1eb3ng....T\u00ean g\u1ecdi \"An Tr\u00fac\" mang \u00fd ngh\u0129a \"mong con s\u1ebd lu\u00f4n th\u1eadt th\u00e0 ngay th\u1eb3ng, c\u00f3 suy ngh\u0129 ,h\u00e0nh \u0111\u1ed9ng v\u00e0 kh\u00ed ph\u00e1ch c\u1ee7a ng\u01b0\u1eddi qu\u00e2n t\u1eed v\u00e0 lu\u00f4n l\u00e0 b\u1ea3o b\u1ed1i qu\u00fd gi\u00e1 c\u1ee7a b\u1ed1 m\u1eb9 v\u00e0 gia \u0111\u00ecnh\"", "sex": 5}
{"first_name": "Anh Tr\u00fac", "meaning": "\"Anh\" g\u1ee3i l\u00ean s\u1ef1 tinh anh, nhanh nh\u1eb9n, lanh l\u1ee3i. \"Tr\u00fac\" l\u00e0 c\u00e2y thu\u1ed9c h\u1ecd tre, th\u00e2n th\u1eb3ng, c\u00f3 m\u00e0u v\u00e0ng c\u00f3 nhi\u1ec1u \u0111\u1ed1t, b\u00ean trong ru\u1ed9t r\u1ed7ng, l\u00e1 nh\u1ecdn m\u1ecdc th\u00e0nh t\u1eebng ch\u00f9m \u1edf g\u1ea7n ng\u1ecdn c\u00e2y. Tr\u00fac thu\u1ed9c b\u1ed9 t\u1ee9 qu\u00fd \"T\u00f9ng, c\u00fac, Tr\u00fac, Mai\" l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a ng\u01b0\u1eddi qu\u00e2n t\u1eed, s\u1ef1 thanh cao, ngay th\u1eb3ng.... T\u00ean g\u1ecdi \"Anh Tr\u00fac\"  mang \u00fd ngh\u0129a \"mong con s\u1ebd lu\u00f4n th\u00f4ng minh, hi\u1ec3u bi\u1ebft, th\u1eadt th\u00e0 ngay th\u1eb3ng, c\u00f3 suy ngh\u0129 ,h\u00e0nh \u0111\u1ed9ng v\u00e0 kh\u00ed ph\u00e1ch c\u1ee7a ng\u01b0\u1eddi qu\u00e2n t\u1eed v\u00e0 lu\u00f4n l\u00e0 b\u1ea3o b\u1ed1i qu\u00fd gi\u00e1 c\u1ee7a b\u1ed1 m\u1eb9 v\u00e0 gia \u0111\u00ecnh\"", "sex": 5}
{"first_name": "B\u0103ng Tr\u00fac", "meaning": "T\u00ean Tr\u00fac l\u1ea5y h\u00ecnh \u1ea3nh t\u1eeb c\u00e2y tr\u00fac, m\u1ed9t lo\u00e0i c\u00e2y quen thu\u1ed9c v\u1edbi cu\u1ed9c s\u1ed1ng \u0111\u00e3 tr\u1edf th\u00e0nh m\u1ed9t bi\u1ec3u t\u01b0\u1ee3ng cho kh\u00ed ch\u1ea5t thanh cao c\u1ee7a con ng\u01b0\u1eddi. Tr\u00fac l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a ng\u01b0\u1eddi qu\u00e2n t\u1eed b\u1edfi lo\u1ea1i c\u00e2y n\u00e0y tuy c\u1ee9ng m\u00e0 v\u1eabn m\u1ec1m m\u1ea1i, \u0111\u1ed5 m\u00e0 kh\u00f4ng g\u00e3y, r\u1ed7ng ru\u1ed9t nh\u01b0 t\u00e2m h\u1ed3n an nhi\u00ean, t\u1ef1 t\u1ea1i, kh\u00f4ng ch\u1ea1y theo quy\u1ec1n v\u1ecb, v\u1eadt ch\u1ea5t. K\u00ea\u0301t h\u01a1\u0323p v\u01a1\u0301i t\u01b0\u0300 B\u0103ng theo ngh\u0129a H\u00e1n Vi\u1ec7t  v\u1eeba h\u00e0m \u00fd ch\u1ec9 c\u00e1i l\u1ea1nh b\u0103ng gia\u0301 v\u1eeba di\u1ec5n t\u1ea3 h\u00ecnh \u1ea3nh b\u0103ng tuy\u1ebft tr\u1eafng mu\u1ed1t, ng\u1ecdc ng\u00e0. T\u00ean \"B\u0103ng Tru\u0301c\" th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 mi\u00eau t\u1ea3 ng\u01b0\u1eddi con g\u00e1i, dung m\u1ea1o xinh \u0111\u1eb9p, ph\u00e2\u0309m ha\u0323nh thanh cao.", "sex": 5}
{"first_name": "B\u1ea3o Tr\u00fac", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"B\u1ea3o\" c\u00f3 hai ngh\u0129a ch\u00ednh: m\u1ed9t l\u00e0 che ch\u1edf, bao b\u1ecdc; hai l\u00e0 ch\u1ec9 nh\u1eefng v\u1eadt gi\u00e1 tr\u1ecb, qu\u00fd hi\u1ebfm. \"Tr\u00fac\" l\u00e0 c\u00e2y thu\u1ed9c h\u1ecd tre, th\u00e2n th\u1eb3ng, c\u00f3 m\u00e0u v\u00e0ng, nhi\u1ec1u \u0111\u1ed1t, r\u00f4\u0303ng ru\u1ed9t, l\u00e1 nh\u1ecdn m\u1ecdc th\u00e0nh t\u1eebng ch\u00f9m \u1edf g\u1ea7n ng\u1ecdn c\u00e2y. Tr\u00fac thu\u1ed9c b\u1ed9 t\u1ee9 qu\u00fd \"T\u00f9ng, C\u00fac, Tr\u00fac, Mai\", l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a ng\u01b0\u1eddi qu\u00e2n t\u1eed, s\u1ef1 thanh cao, ngay th\u1eb3ng... \"B\u1ea3o Tr\u00fac\" c\u00f3 ngh\u0129a l\u00e0 c\u00e2y tr\u00fac qu\u00fd b\u00e1u, \u0111\u01b0\u1ee3c ch\u1edf che. C\u00e1i t\u00ean \"B\u1ea3o Tr\u00fac\" mang \u00fd ngh\u0129a mong con s\u1ebd lu\u00f4n th\u1eadt th\u00e0 ngay th\u1eb3ng, c\u00f3 suy ngh\u0129, h\u00e0nh \u0111\u1ed9ng v\u00e0 kh\u00ed ph\u00e1ch c\u1ee7a ng\u01b0\u1eddi qu\u00e2n t\u1eed, v\u00e0 lu\u00f4n l\u00e0 b\u1ea3o b\u1ed1i qu\u00fd gi\u00e1 c\u1ee7a b\u1ed1 m\u1eb9 v\u00e0 gia \u0111i\u0300nh.", "sex": 5}
{"first_name": "Chi Tr\u00fac", "meaning": "\"Chi tr\u00fac\" t\u1ee9c nh\u00e0nh tr\u00fac l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a m\u1eabu ng\u01b0\u1eddi qu\u00e2n t\u1eed b\u1edfi lo\u00e0i c\u00e2y n\u00e0y tuy c\u1ee9ng m\u00e0 v\u1eabn m\u1ec1m m\u1ea1i, \u0111\u1ed5 m\u00e0 kh\u00f4ng g\u1eaby, r\u1ed7ng ru\u1ed9t nh\u01b0ng tinh th\u1ea7n an nhi\u00ean t\u1ef1 t\u1ea1i, kh\u00f4ng m\u00ea \u0111\u1eafm quy\u1ec1n v\u1ecb, v\u1eadt ch\u1ea5t. \u0110\u00f3 l\u00e0 h\u00ecnh \u1ea3nh hi\u1ebfm th\u1ea5y gi\u1eefa \u0111\u1ea5t tr\u1eddi. L\u1ea5y h\u00ecnh \u1ea3nh c\u00e2y tr\u00fac \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho con, b\u1ed1 m\u1eb9 hi v\u1ecdng con nh\u01b0 c\u00e2y tr\u00fac l\u00e0 d\u00e1ng c\u00e2y c\u00f3 th\u1ebf tr\u1ef1c th\u1eb3ng \u0111\u1ee9ng, phong c\u00e1ch \u0111\u0129nh \u0111\u1ea1c, c\u00e0nh nh\u00e1nh ngay th\u1eb3ng, g\u1ecdn g\u00e0ng, \u0111\u01b0\u1eddng n\u00e9t d\u1ee9t kho\u00e1t, b\u1ea5t khu\u1ea5t, bi\u1ec3u hi\u1ec7n cho ng\u01b0\u1eddi c\u00f3 k\u1ef7 c\u01b0\u01a1ng", "sex": 5}
{"first_name": "D\u00e2n Tr\u00fac", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"D\u00e2n\" ch\u1ec9 s\u1ef1 b\u00ecnh d\u00e2n gi\u1ea3n d\u1ecb, d\u00e2n gi\u1ea3,  \"Tr\u00fac\" l\u1ea5y h\u00ecnh \u1ea3nh t\u1eeb c\u00e2y tr\u00fac, m\u1ed9t lo\u00e0i c\u00e2y quen thu\u1ed9c v\u1edbi cu\u1ed9c s\u1ed1ng \u0111\u00e3 tr\u1edf th\u00e0nh m\u1ed9t bi\u1ec3u t\u01b0\u1ee3ng cho kh\u00ed ch\u1ea5t thanh cao c\u1ee7a con ng\u01b0\u1eddi. T\u00ean \"D\u00e2n Tr\u00fac\" mong mu\u1ed1n con c\u00f3 cu\u1ed9c s\u1ed1ng t\u1ed1t \u0111\u1eb9p, thanh tao, nh\u1eb9 nh\u00e0ng, b\u00ecnh d\u1ecb, an nh\u00e0n, c\u00f3 ngh\u0129a kh\u00ed v\u00e0 b\u1ea3n l\u0129nh", "sex": 5}
{"first_name": "Di Tr\u00fac", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t, \"Tr\u00fac\" l\u1ea5y h\u00ecnh \u1ea3nh t\u1eeb c\u00e2y tr\u00fac, m\u1ed9t lo\u00e0i c\u00e2y quen thu\u1ed9c v\u1edbi cu\u1ed9c s\u1ed1ng \u0111\u00e3 tr\u1edf th\u00e0nh m\u1ed9t bi\u1ec3u t\u01b0\u1ee3ng cho kh\u00ed ch\u1ea5t thanh cao c\u1ee7a con ng\u01b0\u1eddi.\"Di\" l\u00e0  vui v\u1ebb, sung s\u01b0\u1edbng.\"Di Tr\u00fac\" l\u00e0 c\u00e2y tr\u00fac m\u1ea3nh kh\u1ea3nh nh\u01b0ng d\u1ebbo dai, b\u1ec1n b\u1ec9, v\u01b0\u1ee3t qua nhi\u1ec1u kh\u1eafc nghi\u1ec7t c\u1ee7a m\u00f4i tr\u01b0\u1eddng s\u1ed1ng.", "sex": 5}
{"first_name": "Di\u1ec5m Tr\u00fac", "meaning": "\"Di\u1ec5m\" d\u00f9ng \u0111\u1ec3 g\u1ee3i \u0111\u1ebfn h\u00ecnh \u1ea3nh ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, ki\u1ec1u di\u1ec5m, k\u1ebft h\u1ee3p v\u1edbi \"Tr\u00fac\" - trong tranh phong th\u1ee7y h\u00ecnh \u1ea3nh c\u00e2y tr\u00fac th\u01b0\u1eddng l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng m\u1ea1nh m\u1ebd c\u1ee7a s\u1ef1 tr\u01b0\u1eddng th\u1ecd. T\u00ean \"Di\u1ec5m Tr\u00fac\" h\u00e0m \u00fd ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i kh\u00f4ng nh\u1eefng xinh \u0111\u1eb9p m\u00e0 c\u00f2n ki\u00ean c\u01b0\u1eddng v\u01b0\u1ee3t qua m\u1ecdi ngh\u1ecbch c\u1ea3nh, s\u1eb5n s\u00e0ng ch\u1ed1ng ch\u1ecdi v\u1edbi s\u00f3ng gi\u00f3 c\u1ee7a cu\u1ed9c \u0111\u1eddi", "sex": 5}
{"first_name": "Di\u1ec7p Tr\u00fac", "meaning": "\"Di\u1ec7p Tr\u00fac\" l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a l\u00e1 tr\u00fac, ch\u1ec9 con ng\u01b0\u1eddi d\u1ecbu d\u00e0ng, thanh cao v\u00e0 tao nh\u00e3.", "sex": 5}
{"first_name": "D\u01b0\u01a1ng Tr\u00fac", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t,\"D\u01b0\u01a1ng\" trong Th\u00e1i D\u01b0\u01a1ng hay c\u00f2n g\u1ecdi l\u00e0 m\u1eb7t tr\u1eddi \u00fd ch\u1ec9 lu\u00f4n r\u1ea1ng ng\u1eddi, chi\u1ebfu s\u00e1ng. \"Tr\u00fac\" l\u1ea5y h\u00ecnh \u1ea3nh t\u1eeb c\u00e2y tr\u00fac, m\u1ed9t lo\u00e0i c\u00e2y quen thu\u1ed9c v\u1edbi cu\u1ed9c s\u1ed1ng \u0111\u00e3 tr\u1edf th\u00e0nh m\u1ed9t bi\u1ec3u t\u01b0\u1ee3ng cho kh\u00ed ch\u1ea5t thanh cao c\u1ee7a con ng\u01b0\u1eddi. T\u00ean \"D\u01b0\u01a1ng Tr\u00fac\" mang \u00fd ngh\u0129a mong mu\u1ed1n con c\u00f3 cu\u1ed9c s\u1ed1ng thanh tao nho nh\u00e3 nh\u01b0 bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a c\u00e2y tr\u00fac, v\u00e0 lu\u00f4n r\u1ea1ng ng\u01b0\u1eddi nh\u01b0 th\u00e1i d\u01b0\u01a1ng chi\u1ebfu r\u1ecdi.", "sex": 5}
{"first_name": "Giang Tr\u00fac", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t,  \"Tr\u00fac\" l\u1ea5y h\u00ecnh \u1ea3nh t\u1eeb c\u00e2y tr\u00fac, m\u1ed9t lo\u00e0i c\u00e2y quen thu\u1ed9c v\u1edbi cu\u1ed9c s\u1ed1ng \u0111\u00e3 tr\u1edf th\u00e0nh m\u1ed9t bi\u1ec3u t\u01b0\u1ee3ng cho kh\u00ed ch\u1ea5t thanh cao c\u1ee7a con ng\u01b0\u1eddi. \"Giang\" l\u00e0 d\u00f2ng s\u00f4ng, th\u01b0\u1eddng ch\u1ec9 nh\u1eefng \u0111i\u1ec1u cao c\u1ea3, l\u1edbn lao. Ng\u01b0\u1eddi ta th\u01b0\u1eddng l\u1ea5y t\u00ean \"Giang\" \u0111\u1eb7t t\u00ean v\u00ec th\u01b0\u1eddng th\u00edch nh\u1eefng h\u00ecnh \u1ea3nh con s\u00f4ng v\u1eeba \u00eam \u0111\u1ec1m, v\u1eeba m\u1ea1nh m\u1ebd nh\u01b0 cu\u1ed9c \u0111\u1eddi con ng\u01b0\u1eddi c\u00f3 l\u00fac th\u0103ng c\u00f3 l\u00fac tr\u1ea7m.\"Giang Tr\u00fac\", ba m\u1eb9 mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi thanh cao, c\u00f3 cu\u1ed9c s\u1ed1ng \u00e2m \u00eam h\u1ea1nh ph\u00fac.", "sex": 5}
{"first_name": "Giao Tr\u00fac", "meaning": "\"Giao Tr\u00fac\", t\u00ean con bi\u1ec3u t\u01b0\u1ee3ng trong s\u00e1ng tr\u1ebb trung, duy\u00ean d\u00e1ng.", "sex": 5}
{"first_name": "H\u1ea1nh Tr\u00fac", "meaning": "Theo H\u00e1n - Vi\u1ec7t, \"H\u1ea1nh\" th\u1ee9 nh\u1ea5t, c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 ph\u00fac l\u1ed9c, l\u00e0 ph\u01b0\u1edbc l\u00e0nh. Ngh\u0129a th\u1ee9 hai l\u00e0 n\u00f3i v\u1ec1 m\u1eb7t \u0111\u1ea1o \u0111\u1ee9c, t\u00ednh n\u1ebft c\u1ee7a con ng\u01b0\u1eddi. T\u00ean \"H\u1ea1nh Tr\u00fac\" ch\u1ec9 ng\u01b0\u1eddi xinh \u0111\u1eb9p, th\u00f4ng minh, d\u1ecbu d\u00e0ng, n\u1ebft na, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, ph\u1ea9m ch\u1ea5t cao \u0111\u1eb9p, c\u00f3 b\u1ea3n l\u0129nh, kh\u00f4ng ng\u1ea1i gian kh\u00f3", "sex": 5}
