{"first_name": "Ki\u1ec1u Tr\u00fac", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Tr\u00fac\" l\u1ea5y h\u00ecnh \u1ea3nh t\u1eeb c\u00e2y tr\u00fac, m\u1ed9t lo\u00e0i c\u00e2y quen thu\u1ed9c v\u1edbi cu\u1ed9c s\u1ed1ng \u0111\u00e3 tr\u1edf th\u00e0nh m\u1ed9t bi\u1ec3u t\u01b0\u1ee3ng cho kh\u00ed ch\u1ea5t thanh cao c\u1ee7a con ng\u01b0\u1eddi. \"Ki\u1ec1u\" mang \u00fd ngh\u0129a l\u00e0 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, c\u00f3 nhan s\u1eafc rung \u0111\u1ed9ng l\u00f2ng ng\u01b0\u1eddi n\u00ean th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con g\u00e1i v\u1edbi mong mu\u1ed1n c\u00e1c b\u00e9 g\u00e1i khi l\u1edbn l\u00ean s\u1ebd c\u00f3 \u0111\u01b0\u1ee3c dung m\u1ea1o xinh x\u1eafn, duy\u00ean d\u00e1ng v\u00e0 t\u1ea1o \u1ea5n t\u01b0\u1ee3ng v\u1edbi m\u1ecdi ng\u01b0\u1eddi. \"Ki\u1ec1u Tr\u00fac\", ba m\u1eb9 mong mu\u1ed1n con xinh \u0111\u1eb9p duy\u00ean d\u00e1ng thanh cao nh\u01b0 h\u00ecnh \u1ea3nh c\u1ee7a c\u00e2y tr\u00fac.", "sex": 5}
{"first_name": "Kim Tr\u00fac", "meaning": "C\u00e2y tr\u00fac b\u1eb1ng v\u00e0ng", "sex": 5}
{"first_name": "Lam Tr\u00fac", "meaning": "\"Lam\" m\u00e0u xanh, \u0111\u1eadm h\u01a1n so v\u1edbi m\u00e0u xanh da tr\u1eddi m\u00e0u c\u1ee7a may m\u1eafn. \"Tr\u00fac\" l\u00e0 c\u00e2y thu\u1ed9c h\u1ecd tre, l\u00e1 m\u1ecdc th\u00e0nh t\u1eebng ch\u00f9m \u1edf g\u1ea7n ng\u1ecdn c\u00e2y, th\u00e2n c\u00f3 nhi\u1ec1u \u0111\u1ed1t c\u00f3 m\u00e0u v\u00e0ng. Tr\u00fac l\u00e0 m\u1ed9t lo\u1ea1i c\u00e2y thu\u1ed9c b\u1ed9 t\u1ee9 qu\u00fd \"T\u00f9ng, C\u00fac, Tr\u00fac, Mai\", bi\u1ec3u t\u01b0\u1ee3ng cho ng\u01b0\u1eddi qu\u00e2n t\u1eed, s\u1ef1 thanh cao, ngay th\u1eb3ng, trung th\u1ef1c, th\u1eadt th\u00e0. C\u00e1i t\u00ean \"Lam Tr\u00fac\" g\u1ee3i l\u00ean v\u1ebb \u0111\u1eb9p thanh cao c\u00f9ng b\u1ea3n t\u00ednh trung th\u1ef1c th\u1eadt th\u00e0 trong t\u00e2m h\u1ed3n & c\u00f2n th\u1ec3 hi\u1ec7n mong mu\u1ed1n con lu\u00f4n g\u1eb7p may trong cu\u1ed9c s\u1ed1ng c\u1ee7a cha m\u1eb9", "sex": 5}
{"first_name": "Lan Tr\u00fac", "meaning": "T\u00ean lo\u00e0i hoa. Con l\u00e0 \u0111\u1ee9a b\u00e9 xinh \u0111\u1eb9p, trong s\u00e1ng v\u00e0 v\u00f4 c\u00f9ng lanh l\u1ee3i", "sex": 5}
{"first_name": "Linh Tr\u00fac", "meaning": "\"Linh\" l\u00e0 t\u1eeb \u0111\u1ec3 ch\u1ec9 tinh th\u1ea7n con ng\u01b0\u1eddi, tin t\u01b0\u1edfng v\u00e0o nh\u1eefng \u0111i\u1ec1u k\u00ec di\u1ec7u, th\u1ea7n k\u00ec ch\u01b0a l\u00fd gi\u1ea3i \u0111\u01b0\u1ee3c, nh\u01b0 linh thi\u00eang. V\u1ec1 t\u00ednh c\u00e1ch, trong ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Linh\" c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u1eb9n, th\u00f4ng minh. \"Tr\u00fac\" l\u00e0 m\u1ed9t lo\u1ea1i c\u00e2y c\u00f3 c\u00f9ng h\u1ecd v\u1edbi tre, l\u00e0 m\u1ed9t lo\u1ea1i c\u00e2y trong b\u1ed9 t\u1ee9 qu\u00fd \u1edf Vi\u1ec7t Nam: T\u00f9ng, C\u00fac, Tr\u00fac, Mai. C\u00e2y tr\u00fac l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a ng\u01b0\u1eddi qu\u00e2n t\u1eed, c\u00f3 t\u1ea5m l\u00f2ng ngay th\u1eb3ng. T\u00ean \"Linh Tr\u00fac\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi h\u00e0m \u00fd t\u1ed1t l\u00e0nh, l\u00e0 ng\u01b0\u1eddi dung m\u1ea1o \u0111\u00e1ng y\u00eau, t\u00e0i hoa, tinh anh, nhanh nh\u1eb9n, th\u00f4ng minh, ngay th\u1eb3ng, b\u1ea3n l\u0129nh, lu\u00f4n g\u1eb7p may m\u1eafn, \u0111\u01b0\u1ee3c che ch\u1edf, gi\u00fap \u0111\u1ee1 trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
{"first_name": "Loan Tr\u00fac", "meaning": "Loan l\u00e0 chim ph\u01b0\u1ee3ng m\u00e1i linh thi\u00eang, cao qu\u00fd. Tr\u00fac l\u00e0 c\u00e2y tr\u00fac bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a t\u1ea5m l\u00f2ng qu\u00e2n t\u1eed th\u1eb3ng ngay. Loan Tr\u00fac \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi \u00fd ngh\u0129a mong con xinh \u0111\u1eb9p, cao sang, qu\u00fd ph\u00e1i, t\u1ea5m l\u00f2ng qu\u00e2n t\u1eed, s\u1ed1ng th\u1eb3ng ngay, trong s\u1ea1ch, \u0111\u01b0\u1ee3c nhi\u1ec1u ng\u01b0\u1eddi y\u00eau m\u1ebfn, k\u00ednh n\u1ec3", "sex": 5}
{"first_name": "M\u1ea1ch Tr\u00fac", "meaning": "\"Tr\u00fac\" l\u00e0 c\u00e2y tr\u00fac, t\u01b0\u1ee3ng tr\u01b0ng ng\u01b0\u1eddi qu\u00e2n t\u1eed. \"M\u1ea1ch Tr\u00fac\" h\u00e0m ngh\u0129a ng\u01b0\u1eddi c\u00f3 c\u1ed1t c\u00e1ch qu\u00e2n t\u1eed, \u0111\u1ea1o \u0111\u1ee9c \u0111\u00e0ng ho\u00e0ng.", "sex": 3}
{"first_name": "Mai Tr\u00fac", "meaning": "\"Mai\" l\u00e0 t\u00ean lo\u00e0i hoa n\u1edf v\u00e0o m\u00f9a xu\u00e2n, b\u00e1o hi\u1ec7u ni\u1ec1m vui, hy v\u1ecdng. \"Tr\u00fac\" l\u00e0 lo\u00e0i c\u00e2y t\u01b0\u1ee3ng tr\u01b0ng cho t\u1ea5m l\u00f2ng ng\u01b0\u1eddi qu\u00e2n t\u1eed. \"Mai Tr\u00fac\" ngh\u0129a l\u00e0 cha m\u1eb9 mong con xinh \u0111\u1eb9p, vui t\u01b0\u01a1i, tr\u00e0n s\u1ee9c s\u1ed1ng v\u00e0 ngay th\u1eb3ng.", "sex": 5}
{"first_name": "Nam Tr\u00fac", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Tr\u00fac \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi qu\u00e2n t\u1eed, s\u1ed1ng thanh cao, c\u00f3 kh\u00ed ph\u00e1ch, kh\u00f4ng s\u1ee3 tr\u1edf ng\u1ea1i", "sex": 7}
{"first_name": "Ng\u00e2n Tr\u00fac", "meaning": "\"Ng\u00e2n Tr\u00fac\", con s\u1ebd l\u00e0 nh\u1eefng ti\u1ebfng s\u00e1o trong tr\u1ebbo v\u00f4 ng\u1ea7n cho cu\u1ed9c \u0111\u1eddi.", "sex": 5}
{"first_name": "Nguy\u1ec7t Tr\u00fac", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, nguy\u1ec7t l\u00e0 v\u1ea7ng tr\u0103ng, Tr\u0103ng c\u00f3 v\u1ebb \u0111\u1eb9p v\u00f4 c\u00f9ng b\u00ecnh d\u1ecb, m\u1ed9t v\u1ebb \u0111\u1eb9p kh\u00f4ng c\u1ea7n trang s\u1ee9c, \u0111\u1eb9p m\u1ed9t c\u00e1ch v\u00f4 t\u01b0, h\u1ed3n nhi\u00ean. Tr\u0103ng t\u01b0\u1ee3ng tr\u01b0ng cho v\u1ebb \u0111\u1eb9p h\u1ed3n nhi\u00ean n\u00ean tr\u0103ng ho\u00e0 v\u00e0o thi\u00ean nhi\u00ean, ho\u00e0 v\u00e0o c\u00e2y c\u1ecf. T\u00ean Nguy\u1ec7t Tr\u00fac v\u1eeba g\u1ee3i v\u1ebb \u0111\u1eb9p b\u00ecnh d\u1ecb, v\u00f4 t\u01b0, v\u1eeba n\u00f3i l\u00ean t\u00ednh c\u00e1ch ki\u00ean c\u01b0\u1eddng, \u0111\u1ea7y b\u1ea3n l\u0129nh, kh\u00f4ng ng\u1ea1i kh\u00f3 kh\u0103n c\u1ee7a ng\u01b0\u1eddi qu\u00e2n t\u1eed", "sex": 5}
{"first_name": "Nh\u00e3 Tr\u00fac", "meaning": "Theo ngh\u0129a Ti\u1ebfng Vi\u1ec7t, \"Nh\u00e3\" c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 l\u1ecbch s\u1ef1, nh\u00e3 nh\u1eb7n, h\u00f2a nh\u00e3, \"Tr\u00fac\" l\u00e0 m\u1ed9t lo\u00e0i c\u00e2y c\u00f3 \u0111\u1ed1t nh\u01b0 tre, th\u00e2n m\u1ea3nh, l\u00e1 d\u00e0i. T\u00ean \"Nh\u00e3 Tr\u00fac\" d\u00f9ng \u0111\u1ec3 g\u1ee3i \u0111\u1ebfn h\u00ecnh \u1ea3nh ng\u01b0\u1eddi con g\u00e1i thanh t\u00fa, l\u1ecbch thi\u1ec7p, d\u00e1ng ng\u01b0\u1eddi mong manh nh\u01b0ng r\u1ea5t kh\u1ecfe kh\u1eafn, lu\u00f4n v\u1eefng v\u00e0ng cho d\u00f9 c\u00f3 g\u1eb7p kh\u00f3 kh\u0103n, v\u1ea5p ng\u00e3.", "sex": 5}
