{"first_name": "Nhi Tr\u00fac", "meaning": "\"Nhi\" c\u00f3 ngh\u0129a l\u00e0 nh\u1ecf nh\u1eafn, \u0111\u00e1ng y\u00eau \"Tr\u00fac\" l\u00e0 c\u00e2y tr\u00fac m\u1ec1m m\u1ea1i m\u00e0 thanh cao bi\u1ec3u t\u01b0\u1ee3ng cho ng\u01b0\u1eddi qu\u00e2n t\u1eeb. \"Nhi Tr\u00fac\" \u00fd n\u00f3i con l\u00e0 ng\u01b0\u1eddi qu\u00e2n t\u1eed, s\u1ed1ng thanh cao.", "sex": 5}
