{"first_name": "Ph\u01b0\u01a1ng Tr\u00fac", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ph\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 ph\u01b0\u01a1ng h\u01b0\u1edbng, \"Tr\u00fac\" l\u00e0 t\u00ean m\u1ed9t lo\u1ea1i c\u00e2y c\u00f3 \u0111\u1ed1t nh\u01b0 tre, th\u00e2n m\u1ea3nh, l\u00e1 d\u00e0i, da\u0301ng th\u1eb3ng. T\u00ean \"Ph\u01b0\u01a1ng Tr\u00fac\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i duy\u00ean d\u00e1ng, mong manh nh\u01b0ng \u0111\u1ea7y b\u1ea3n l\u0129nh, m\u1ea1nh m\u1ebd, lu\u00f4n c\u00f3 \u00fd ch\u00ed ph\u1ea5n \u0111\u1ea5u, v\u01b0\u01a1n l\u00ean \u0111\u1ec3 th\u00e0nh c\u00f4ng.", "sex": 5}
{"first_name": "Qu\u1ef3nh Tr\u00fac", "meaning": "\"Qu\u1ef3nh\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa th\u01b0\u1eddng hay n\u1edf v\u00e0o l\u00fac 12 gi\u1edd \u0111\u00eam. Hoa qu\u1ef3nh c\u00f3 m\u00e0u tr\u1eafng tinh kh\u00f4i, c\u00f3 m\u00f9i h\u01b0\u01a1ng thanh khi\u1ebft, d\u1ecbu d\u00e0ng. \"Tr\u00fac\" l\u00e0 c\u00e2y tr\u00fac, bi\u1ec3u t\u01b0\u1ee3ng cho ng\u01b0\u1eddi qu\u00e2n t\u1eed b\u1edfi lo\u1ea1i c\u00e2y n\u00e0y tuy c\u1ee9ng m\u00e0 v\u1eabn m\u1ec1m m\u1ea1i, \u0111\u1ed5 m\u00e0 kh\u00f4ng g\u00e3y, r\u1ed7ng ru\u1ed9t nh\u01b0 t\u00e2m h\u1ed3n an nhi\u00ean, t\u1ef1 t\u1ea1i, kh\u00f4ng ch\u1ea1y theo quy\u1ec1n v\u1ecb, v\u1eadt ch\u1ea5t. T\u00ean \"Qu\u1ef3nh Tr\u00fac\" l\u00e0 mong mu\u1ed1n con s\u1ebd \u0111\u1eb9p nh\u01b0 hoa qu\u1ef3nh v\u00e0 thanh cao nh\u01b0 nh\u00e0nh tr\u00fac.", "sex": 5}
{"first_name": "Sa Tr\u00fac", "meaning": "T\u00ean \"Tr\u00fac\" l\u1ea5y h\u00ecnh \u1ea3nh t\u1eeb c\u00e2y tr\u00fac, m\u1ed9t lo\u00e0i c\u00e2y quen thu\u1ed9c v\u1edbi cu\u1ed9c s\u1ed1ng \u0111\u00e3 tr\u1edf th\u00e0nh m\u1ed9t bi\u1ec3u t\u01b0\u1ee3ng cho kh\u00ed ch\u1ea5t thanh cao c\u1ee7a con ng\u01b0\u1eddi. \u0110\u1eb7t t\u00ean \"Sa Tr\u00fac\" l\u00e0 mong con c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, duy\u00ean d\u00e1ng, d\u1ecbu d\u00e0ng, t\u00e2m h\u1ed3n an nhi\u00ean, t\u1ef1 t\u1ea1i, kh\u00f4ng ch\u1ea1y theo quy\u1ec1n v\u1ecb, v\u1eadt ch\u1ea5t.", "sex": 5}
