{"first_name": "Xoan Tr\u00fac", "meaning": "\"Tr\u00fac\" l\u00e0 m\u1ed9t lo\u00e0i c\u00e2y thanh tao qu\u00fd ph\u00e1i. \"Xoan Tr\u00fac\", con v\u00f9a c\u00f3 n\u00e9t \u0111\u1eb9p thanh tao c\u1ee7a c\u00e2y tr\u00fac v\u00e0 qu\u00fd ph\u00e1i c\u1ee7a c\u00e2y xoan.", "sex": 5}
