{"first_name": "B\u1ed5n Trung", "meaning": "\"Trung\" l\u00e0 l\u00f2ng trung th\u00e0nh, l\u00e0 s\u1ef1 t\u1eadn trung, kh\u00f4ng thay l\u00f2ng \u0111\u1ed5i d\u1ea1. \"B\u1ed5n\" t\u1ee9c  b\u1ed5n l\u0129nh \u00fd ch\u1ec9 t\u00e0i ngh\u1ec7, t\u00e0i n\u0103ng. \"B\u1ed5n Trung\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t t\u00ean  cho ng\u01b0\u1eddi con trai v\u1edbi mong mu\u1ed1n lu\u00f4n gi\u1eef \u0111\u01b0\u1ee3c s\u1ef1 ki\u00ean trung b\u1ea5t \u0111\u1ecbnh, \u00fd ch\u00ed s\u1eaft \u0111\u00e1, kh\u00f4ng b\u1ecb dao \u0111\u1ed9ng tr\u01b0\u1edbc b\u1ea5t k\u1ef3 ho\u00e0n c\u1ea3nh n\u00e0o.", "sex": 3}
{"first_name": "Ch\u00ednh Trung", "meaning": "\"Trung\" l\u00e0 l\u00f2ng trung th\u00e0nh, l\u00e0 s\u1ef1 t\u1eadn trung, kh\u00f4ng thay l\u00f2ng \u0111\u1ed5i d\u1ea1. \"Ch\u00ednh\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u00fang \u0111\u1eafn, th\u1eb3ng th\u1eafn, h\u1ee3p v\u1edbi quy ph\u1ea1m, \u0111\u00fang theo ph\u00e9p t\u1eafc. \"Ch\u00ednh Trung\" l\u00e0 t\u00ean th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho ng\u01b0\u1eddi con trai v\u1edbi mong mu\u1ed1n lu\u00f4n gi\u1eef \u0111\u01b0\u1ee3c s\u1ef1 ki\u00ean trung b\u1ea5t \u0111\u1ecbnh, \u00fd ch\u00ed ngay th\u1eb3ng, kh\u00f4ng b\u1ecb dao \u0111\u1ed9ng tr\u01b0\u1edbc b\u1ea5t k\u1ef3 ho\u00e0n c\u1ea3nh n\u00e0o.", "sex": 3}
{"first_name": "Chuy\u00ean Trung", "meaning": "\"Trung\" l\u00e0 \u1edf gi\u1eefa. \"Chuy\u00ean Trung\" ngh\u0129a l\u00e0 t\u1eadp trung v\u00e0o \u0111i\u1ec1u quan tr\u1ecdng nh\u1ea5t, ch\u1ec9 con ng\u01b0\u1eddi chu\u1ea9n m\u1ef1c, ch\u00ednh x\u00e1c, nghi\u00eam t\u00fac.", "sex": 3}
{"first_name": "C\u01b0\u1eddng Trung", "meaning": "\"C\u01b0\u1eddng\" theo ti\u1ebfng H\u00e1n Vi\u1ec7t l\u00e0 l\u1ef1c l\u01b0\u1ee1ng, uy l\u1ef1c v\u1edbi ngh\u0129a bao h\u00e0m s\u1ef1 n\u1ed5i tr\u1ed9i v\u1ec1 th\u1ec3 ch\u1ea5t, m\u1ea1nh kh\u1ecfe tr\u00ean nhi\u1ec1u ph\u01b0\u01a1ng di\u1ec7n. \"Trung\" c\u00f3 \u00fd ngh\u0129a lu\u00f4n gi\u1eef \u0111\u01b0\u1ee3c s\u1ef1 ki\u00ean trung b\u1ea5t \u0111\u1ecbnh, \u00fd ch\u00ed s\u1eaft \u0111\u00e1, kh\u00f4ng b\u1ecb dao \u0111\u1ed9ng tr\u01b0\u1edbc b\u1ea5t k\u1ef3 ho\u00e0n c\u1ea3nh n\u00e0o. \u0110\u1eb7t t\u00ean \"C\u01b0\u1eddng Trung\" cho con, b\u1ed1 m\u1eb9 mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi c\u00f3 kh\u00ed ch\u1ea5t v\u1eefng v\u00e0ng ki\u00ean \u0111\u1ecbnh, c\u1ee9ng c\u1ecfi, quy\u1ebft \u0111o\u00e1n.", "sex": 3}
