{"first_name": "Gia Trung", "meaning": "\"Trung\" l\u00e0 l\u00f2ng trung th\u00e0nh, l\u00e0 s\u1ef1 t\u1eadn trung, kh\u00f4ng thay l\u00f2ng \u0111\u1ed5i d\u1ea1. \"Gia\" l\u00e0 gia \u0111\u00ecnh, l\u00e0 m\u00e1i nh\u00e0 n\u01a1i m\u1ecdi ng\u01b0\u1eddi sum v\u1ea7y, sinh ho\u1ea1t b\u00ean nhau. Ngo\u00e0i ra ch\u1eef \"Gia\" c\u00f2n c\u00f3 ngh\u0129 l\u00e0 xinh \u0111\u1eb9p, \u01b0u t\u00fa, mang ph\u1ea9m ch\u1ea5t cao qu\u00fd. \"Gia Trung\" mang \u00fd ngh\u0129a con lu\u00f4n l\u00e0 ng\u01b0\u1eddi con c\u1ee7a gia \u0111\u00ecnh, lu\u00f4n l\u00e0 ni\u1ec1m vui v\u00e0 g\u1eafn b\u00f3 y\u00eau th\u01b0\u01a1ng gia \u0111\u00ecnh m\u00ecnh.", "sex": 3}
{"first_name": "Ki\u00ean Trung", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Trung\" l\u00e0 l\u00f2ng trung th\u00e0nh, l\u00e0 s\u1ef1 t\u1eadn trung, kh\u00f4ng thay l\u00f2ng \u0111\u1ed5i d\u1ea1. \"Ki\u00ean\" l\u00e0 th\u1ec3 hi\u1ec7n s\u1ef1 v\u1eefng v\u00e0ng, b\u1ec1n v\u1eefng, trong ki\u1ebfn c\u1ed1, ki\u00ean trung, ki\u00ean \u0111\u1ecbnh l\u00e0 nh\u1eefng t\u00ednh t\u1eeb th\u1ec3 hi\u1ec7n s\u1ef1 v\u1eefng b\u1ec1n. \"Ki\u00ean Trung\" l\u00e0 \u00fd ch\u00ed b\u1ec1n v\u1eefng, m\u1ea1nh m\u1ebd, c\u1ea7u ti\u1ebfn.", "sex": 3}
{"first_name": "Ki\u1ec7t Trung", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"Trung\" l\u00e0 l\u00f2ng trung th\u00e0nh, l\u00e0 s\u1ef1 t\u1eadn trung, kh\u00f4ng thay l\u00f2ng \u0111\u1ed5i d\u1ea1. \"Ki\u1ec7t\" trong ti\u1ebfng H\u00e1n - Vi\u1ec7t \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi t\u00e0i n\u0103ng v\u01b0\u1ee3t tr\u1ed9i, th\u00f4ng minh nhanh tr\u00ed h\u01a1n ng\u01b0\u1eddi. \"Ki\u1ec7t Trung\",  mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi trung ngh\u0129a h\u00e0o ki\u1ec7t, th\u00f4ng minh t\u00e0i gi\u1ecfi v\u00e0 l\u00e0 ng\u01b0\u1eddi t\u1eadn trung kh\u00f4ng thay \u0111\u1ed5i d\u00f9 c\u00f3 kh\u00f3 kh\u0103n th\u1ebf n\u00e0o v\u1eabn lu\u00f4n trung th\u00e0nh trung ki\u00ean.", "sex": 3}
{"first_name": "Long Trung", "meaning": "Long l\u00e0 r\u1ed3ng, bi\u1ec3u t\u01b0\u1ee3ng c\u1ee7a tr\u00ed th\u00f4ng minh & th\u1ecbnh v\u01b0\u1ee3ng. Trung l\u00e0 t\u1ea5m l\u00f2ng c\u1ee7a b\u1eadc qu\u00e2n t\u1eed, s\u1ed1ng trung th\u00e0nh kh\u00f4ng d\u1ec5 thay l\u00f2ng \u0111\u1ed5i d\u1ea1. Long Trung mang \u00fd ngh\u0129a con s\u1ebd th\u00f4ng minh, qu\u00e2n t\u1eed & c\u00f3 cu\u1ed9c s\u1ed1ng th\u1ecbnh v\u01b0\u1ee3ng", "sex": 3}
{"first_name": "Minh Trung", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Minh\" c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, hi\u1ec3u bi\u1ebft, s\u00e1ng su\u1ed1t, \"Trung\" c\u00f3 ngh\u0129a la\u0300 l\u00f2ng trung th\u00e0nh, l\u00e0 s\u1ef1 t\u1eadn trung, kh\u00f4ng thay l\u00f2ng \u0111\u1ed5i d\u1ea1. T\u00ean \"Minh Trung\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, c\u00f3 ph\u1ea9m ch\u1ea5t trung th\u00e0nh, c\u00f3 t\u00e0i c\u00f3 \u0111\u1ee9c, l\u00e0m \u0111\u01b0\u1ee3c nh\u1eefng vi\u1ec7c l\u1edbn v\u00e0 th\u00e0nh \u0111\u1ea1t", "sex": 3}
{"first_name": "M\u1ef9 Trung", "meaning": "\"M\u1ef9\" c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p, t\u1ed1t l\u00e0nh theo ki\u1ec3u nh\u1eb9 nh\u00e0ng m\u1ec1m m\u1ea1i. \"Trung\" l\u00e0 trung th\u00e0nh. \"M\u1ef9 Trung\" ngh\u0129a l\u00e0 mong con xinh \u0111\u1eb9p, s\u1ed1ng trung th\u00e0nh, kh\u00f4ng thay l\u00f2ng \u0111\u1ed5i d\u1ea1.", "sex": 5}
{"first_name": "Nam Trung", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Trung \u0111\u01b0\u1ee3c \u0111\u1eb7t nh\u1eb1m mong mu\u1ed1n con lu\u00f4n gi\u1eef \u0111\u01b0\u1ee3c s\u1ef1 ki\u00ean trung b\u1ea5t \u0111\u1ecbnh, \u00fd ch\u00ed s\u1eaft \u0111\u00e1, kh\u00f4ng b\u1ecb dao \u0111\u1ed9ng tr\u01b0\u1edbc b\u1ea5t k\u1ef3 ho\u00e0n c\u1ea3nh n\u00e0o", "sex": 3}
{"first_name": "Ngh\u0129a Trung", "meaning": "\"Ngh\u0129a Trung\" l\u00e0 hai \u0111\u1ee9c t\u00ednh t\u1ed1t \u0111\u1eb9p c\u1ee7a con ng\u01b0\u1eddi trung tr\u1ef1c kh\u1eb3ng kh\u00e1i, trung th\u00e0nh m\u1ed9t l\u00f2ng s\u1eaft son, qu\u00fd tr\u1ecdng l\u1ec5 ngh\u0129a, l\u1ebd ph\u1ea3i. V\u1edbi t\u00ean n\u00e0y cha m\u1eb9 mong con s\u1ebd c\u00f3 \u0111\u01b0\u1ee3c nh\u1eefng \u0111\u1ee9c t\u00ednh qu\u00fd gi\u00e1, t\u1ed1t \u0111\u1eb9p c\u1ee7a m\u1ed9t \u0111\u1ea5ng nam nhi.", "sex": 3}
{"first_name": "Ninh Trung", "meaning": "\"Trung\" l\u00e0 \u1edf gi\u1eefa. \"Ninh Trung\" l\u00e0 \u1edf gi\u1eefa s\u1ef1 an \u0111\u1ecbnh, h\u00e0m ngh\u0129a con ng\u01b0\u1eddi b\u00ecnh y\u00ean, t\u1ed1t \u0111\u1eb9p.", "sex": 3}
