{"first_name": "U\u1ea9n Trung", "meaning": "\"Trung\" l\u00e0 l\u00f2ng trung th\u00e0nh, l\u00e0 s\u1ef1 t\u1eadn trung, kh\u00f4ng thay l\u00f2ng \u0111\u1ed5i d\u1ea1. \"U\u1ea9n\" c\u00f3 ngh\u0129a l\u00e0 ti\u1ec1m \u1ea9n s\u1ee9c m\u1ea1nh. \"U\u1ea9n Trung\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t t\u00ean  cho ng\u01b0\u1eddi con trai v\u1edbi mong mu\u1ed1n lu\u00f4n gi\u1eef \u0111\u01b0\u1ee3c s\u1ef1 ki\u00ean trung b\u1ea5t \u0111\u1ecbnh, \u00fd ch\u00ed s\u1eaft \u0111\u00e1, kh\u00f4ng b\u1ecb dao \u0111\u1ed9ng tr\u01b0\u1edbc b\u1ea5t k\u1ef3 ho\u00e0n c\u1ea3nh n\u00e0o\u00f3 s\u1ee9c m\u1ea1nh, h\u1ebft l\u00f2ng h\u1ebft d\u1ea1 trung th\u00e0nh.", "sex": 3}
{"first_name": "Uy Trung", "meaning": "\"Trung\" l\u00e0 l\u00f2ng trung th\u00e0nh, l\u00e0 s\u1ef1 t\u1eadn trung, kh\u00f4ng thay l\u00f2ng \u0111\u1ed5i d\u1ea1. \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd, c\u00f3 th\u1ebf l\u1ef1c, lu\u00f4n m\u1ea1nh m\u1ebd v\u00e0 \u0111\u1ea7y b\u1ea3n l\u0129nh. V\u00ec v\u1eady, \"Uy Trung\" th\u01b0\u1eddng d\u00f9ng \u0111\u1eb7t t\u00ean cho ng\u01b0\u1eddi con trai v\u1edbi t\u00ednh c\u00e1ch m\u1ea1nh, hi\u00ean ngang, t\u1eadn t\u00e2m t\u1eadn t\u1ee5y h\u1ebft m\u00ecnh.", "sex": 3}
