{"first_name": "\u0110\u00ecnh Tr\u1ef1c", "meaning": "\"\u0110\u00ecnh\" l\u00e0 d\u1eebng l\u1ea1i. \"\u0110\u00ecnh Tr\u1ef1c\" ngh\u0129a l\u00e0 ng\u01b0\u1eddi bi\u1ebft d\u1eebng \u0111\u00fang l\u00fac, hi\u1ec3u bi\u1ebft th\u1eddi th\u1ebf c\u00e2n nh\u1eafc thi\u1ec7t h\u01a1n, t\u1ecf t\u01b0\u1eddng m\u1ecdi vi\u1ec7c.", "sex": 3}
