{"first_name": "B\u1ea3o Tr\u00ecnh", "meaning": "Ch\u1eef B\u1ea3o theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o. T\u00ean \"B\u1ea3o Tr\u00ecnh\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con nh\u01b0 h\u00e0m \u00fd con ch\u00ednh l\u00e0 b\u1ea3o v\u1eadt m\u00e0 b\u1ed1 m\u1eb9 lu\u00f4n n\u00e2ng niu, gi\u1eef g\u00ecn. Mong con s\u1ed1ng bi\u1ebft \u0111\u1ea1o l\u00fd, l\u1ec5 ngh\u0129a, s\u1ed1ng li\u00eam khi\u1ebft, \u0111\u01b0\u1ee3c t\u00f4n tr\u1ecdng, k\u00ednh n\u1ec3", "sex": 3}
