{"first_name": "Nh\u00e2n Tr\u00ecnh", "meaning": "Nh\u00e2n trong ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ng\u01b0\u1eddi, thi\u00ean ch\u1ec9 v\u1ec1 ph\u1ea7n t\u00ednh c\u00e1ch v\u00ec Nh\u00e2n c\u00f2n c\u00f3 ngh\u0129a l\u00e0 ph\u1ea7n gi\u00e1 tr\u1ecb c\u1ed1t l\u00f5i b\u00ean trong. V\u00e0 \u1edf m\u1ed9t ngh\u0129a kh\u00e1c nh\u00e2n c\u00f2n \u00fd ch\u1ec9 s\u1ef1 vi\u1ec7c do con ng\u01b0\u1eddi t\u1ea1o ra, t\u00f9y thu\u1ed9c v\u00e0o h\u00e0nh \u0111\u1ed9ng \u0111\u00f3 m\u00e0 mang l\u1ea1i k\u1ebft qu\u1ea3 t\u1ed1t ho\u1eb7c x\u1ea5u. V\u00ec th\u1ebf t\u00ean Nh\u00e2n Tr\u00ecnh mang \u00fd ngh\u0129a mong mu\u1ed1n con s\u1ebd s\u1ed1ng nh\u00e2n h\u1eadu, l\u01b0\u01a1ng thi\u1ec7n, bi\u1ebft y\u00eau th\u01b0\u01a1ng, lu\u00f4n l\u00e0m vi\u1ec7c t\u1ed1t \u0111\u1ec3 h\u01b0\u1edfng qu\u1ea3 ng\u1ecdt.", "sex": 3}
{"first_name": "Ph\u01b0\u01a1ng Tr\u00ecnh", "meaning": "Ch\u1eef  \"Ph\u01b0\u01a1ng\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t ngh\u0129a l\u00e0 h\u01b0\u1edbng, v\u1ecb tr\u00ed, \u0111\u1ea1o l\u00fd. T\u00ean \"Ph\u01b0\u01a1ng Tr\u00ecnh\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi bi\u1ebft \u0111\u1ea1o l\u00fd l\u00e0m ng\u01b0\u1eddi, bi\u1ebft ph\u00e2n bi\u1ec7t t\u1ed1t x\u1ea5u, \u0111\u00fang sai. Th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi s\u00e1ng su\u1ed1t, tr\u00ed tu\u1ec7. T\u00ean  \"Ph\u01b0\u01a1ng Tr\u00ecnh\" l\u00e0 mong mu\u1ed1n c\u1ee7a cha m\u1eb9 mu\u1ed1n con m\u00ecnh lu\u00f4n l\u00e0m nh\u1eefng \u0111i\u1ec1u t\u1ed1t, bi\u1ebft c\u00e1ch \u0111\u1ed1i nh\u00e2n x\u1eed th\u1ebf, l\u00e0m cha m\u1eb9 y\u00ean l\u00f2ng", "sex": 3}
