{"first_name": "M\u1eabn Tr\u1ecbnh", "meaning": "\"M\u1eabn\" c\u00f3 ngh\u0129a l\u00e0 minh m\u1eabn, s\u00e1ng su\u1ed1t. \"Tr\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 trang tr\u1ecdng, tr\u1ecbnh tr\u1ecdng th\u1ec3 hi\u1ec7n s\u1ef1 k\u00ednh n\u1ec3. \"M\u1eabn Tr\u1ecbnh\" \u00fd n\u00f3i con th\u00f4ng minh, s\u00e1ng su\u1ed1t trong c\u00e1ch x\u1eed l\u00fd v\u00e0 nh\u00ecn nh\u1eadn v\u1ea5n \u0111\u1ec1 n\u00ean lu\u00f4n \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi k\u00ednh n\u1ec3, y\u00eau th\u01b0\u01a1ng.", "sex": 3}
{"first_name": "Nhi Tr\u1ecbnh", "meaning": "\"Nhi\" c\u00f3 ngh\u0129a l\u00e0 nh\u1ecf nh\u1eafn, \u0111\u00e1ng y\u00eau \"Tr\u1ecbnh\" c\u00f3 ngh\u0129a l\u00e0 c\u1ea9n th\u1eadn, trang tr\u1ecdng. \"Nhi Tr\u1ecbnh\" mang \u00fd ngh\u0129a l\u00e0 con bi\u1ebft c\u1ea9n tr\u1ecdng lo toan, s\u1ed1ng theo l\u1ec5 nghi, ph\u00e9p t\u1eafc.", "sex": 5}
{"first_name": "C\u00f4ng Tr\u00e0o", "meaning": "\"C\u00f4ng\" l\u00e0 c\u1ee7a chung. \"C\u00f4ng Tr\u00e0o\" l\u00e0 ng\u01b0\u1eddi n\u1ed7 l\u1ef1c v\u00ec c\u00e1i chung, \u0111\u00f3ng g\u00f3p v\u00e0o t\u1eadp th\u1ec3.", "sex": 3}
{"first_name": "An Tr\u01b0\u1eddng", "meaning": "\"An\" l\u00e0 b\u00ecnh y\u00ean. \"An Tr\u01b0\u1eddng\" l\u00e0 s\u1ef1 b\u00ecnh y\u00ean l\u00e2u d\u00e0i.", "sex": 3}
{"first_name": "Chinh Tr\u01b0\u1eddng", "meaning": "\"Chinh Tr\u01b0\u1eddng\" t\u1ee9c cu\u1ed9c \u0111i xa v\u00ec m\u1ed9t m\u1ee5c \u0111\u00edch l\u1edbn, l\u00fd t\u01b0\u1edfng, \u0111\u1eb7t t\u00ean n\u00e0y cho con b\u1ed1 m\u1eb9 hi v\u1ecdng con l\u00e0 ng\u01b0\u1eddi c\u00f3 b\u1ea3n l\u0129nh, ho\u00e0i b\u00e3o \u00fd ch\u00ed l\u1edbn lao \u0111\u01b0\u1ee3c x\u00e1c l\u1eadp b\u1eb1ng \u00fd ch\u00ed ki\u00ean \u0111\u1ecbnh, t\u00ednh k\u1ef7 lu\u1eadt cao \u0111\u1ed9 v\u00e0 l\u00f2ng qu\u1ea3 c\u1ea3m m\u1ea1nh m\u1ebd.", "sex": 7}
{"first_name": "Duy Tr\u01b0\u1eddng", "meaning": "Duy trong ti\u1ebfng h\u00e1n vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u01b0 duy, suy ngh\u0129 th\u1ea5u \u0111\u00e1o. Ng\u01b0\u1eddi t\u00ean Duy Tr\u01b0\u1eddng c\u00f3 t\u00ednh ki\u00ean \u0111\u1ecbnh, nh\u1eabn n\u1ea1i, can \u0111\u1ea3m v\u01b0\u1ee3t qua nh\u1eefng th\u1eed th\u00e1ch trong cu\u1ed9c s\u1ed1ng, lu\u00f4n kh\u1ecfe m\u1ea1nh v\u00e0 tr\u01b0\u1eddng th\u1ecd", "sex": 3}
{"first_name": "Giang Tr\u01b0\u1eddng", "meaning": "\"Giang Tr\u01b0\u1eddng\", con s\u1ebd m\u1ea1nh m\u1ebd, ki\u00ean tr\u00ec, nh\u1eabn n\u1ea1i nh\u01b0 d\u00f2ng tr\u01b0\u1eddng giang.", "sex": 3}
