{"first_name": "Long Tr\u01b0\u1eddng", "meaning": "\"Tr\u01b0\u1eddng\" c\u00f3 ngh\u0129a l\u00e0 tr\u00e3i d\u00e0i v\u00f4 t\u1eadn, v\u01b0\u01a1n cao v\u01b0\u01a1n xa, th\u1ec3 hi\u1ec7n s\u1ef1 tr\u01b0\u1eddng t\u1ed3n, v\u0129nh c\u1eedu. \u0110i c\u00f9ng t\u00ean l\u00f3t l\u00e0 \"Long\" c\u00f3 ngh\u0129a l\u00e0 r\u1ed3ng, t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 h\u01b0ng th\u1ecbnh, gi\u00e0u c\u00f3, uy quy\u1ec1n & may m\u1eafn, t\u00ean \"Long Tr\u01b0\u1eddng\" c\u00f3 \u00fd ngh\u0129a con s\u1ebd c\u00f3 cu\u1ed9c s\u1ed1ng sung s\u01b0\u1edbng, th\u1ecbnh v\u01b0\u1ee3ng may m\u1eafn c\u1ea3 \u0111\u1eddi", "sex": 3}
