{"first_name": "Nam Tr\u01b0\u1eddng", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Tr\u01b0\u1eddng mang \u00fd ngh\u0129a v\u1ec1 \u00fd ch\u00ed ki\u00ean c\u01b0\u1eddng, c\u00f3 l\u1eadp tr\u01b0\u1eddng b\u1ec1n v\u1eefng, d\u00f9 c\u00f3 kh\u00f3 kh\u0103n hay v\u1ea5p ng\u00e3 c\u0169ng c\u00f3 th\u1ec3 \u0111\u1ee9ng v\u1eefng. Ngo\u00e0i ra, c\u00f2n c\u00f3 \u00fd ngh\u0129a mong con s\u1ebd m\u1ea1nh kh\u1ecfe v\u00e0 s\u1ed1ng l\u00e2u", "sex": 3}
{"first_name": "Nh\u1ea5t Tr\u01b0\u1eddng", "meaning": "\"Tr\u01b0\u1eddng\" l\u00e0 l\u00e2u d\u00e0i. \"Nh\u1ea5t\" l\u00e0 gi\u1ecfi giang, \u0111\u1ee9ng \u0111\u1ea7u. \"Nh\u1ea5t Tr\u01b0\u1eddng\" l\u00e0 ng\u01b0\u1eddi lu\u00f4n \u0111\u1ee9ng \u0111\u1ea7u, gi\u1ecfi giang th\u00f4ng minh.", "sex": 3}
{"first_name": "Nh\u1eadt Tr\u01b0\u1eddng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Nh\u1eadt\" ngh\u0129a l\u00e0 m\u1eb7t tr\u1eddi, \"Tr\u01b0\u1eddng\" ngh\u0129a l\u00e0 xa, d\u00e0i, b\u1ec1n b\u1ec9. T\u00ean \"Nh\u1eadt Tr\u01b0\u1eddng\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi t\u00e0i gi\u1ecfi, th\u00f4ng minh, ki\u00ean c\u01b0\u1eddng, c\u00f3 kh\u1ea3 n\u0103ng ch\u1ecbu \u0111\u1ef1ng v\u00e0 th\u00edch nghi. \"Nh\u1eadt Tr\u01b0\u1eddng\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c g\u1eedi g\u1eafm v\u1edbi \u00fd ngh\u0129a v\u1ec1 cu\u1ed9c s\u1ed1ng xa\u0301n la\u0323n, t\u01b0\u01a1i \u0111\u1eb9p, g\u1eb7p nhi\u1ec1u may m\u1eafn.", "sex": 3}
{"first_name": "Ninh Tr\u01b0\u1eddng", "meaning": "\"Tr\u01b0\u1eddng\" l\u00e0 d\u00e0i l\u00e2u. \"Ninh Tr\u01b0\u1eddng\" ch\u1ec9 \u01b0\u1edbc v\u1ecdng an b\u00ecnh d\u00e0i l\u00e2u, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi h\u1ea1nh ph\u00fac an l\u1ea1c c\u1ea3 \u0111\u1eddi.", "sex": 3}
{"first_name": "Ph\u00fac Tr\u01b0\u1eddng", "meaning": "Ph\u00fac \u0111\u1ee9c c\u1ee7a d\u00f2ng h\u1ecd s\u1ebd tr\u01b0\u1eddng t\u1ed3n m\u00e3i b\u00ean con", "sex": 3}
{"first_name": "Quang Tr\u01b0\u1eddng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Quang\" c\u00f3 ngh\u0129a l\u00e0 s\u00e1ng, \u00e1nh s\u00e1ng, l\u00e0 v\u1ebb vang, s\u1ea1ch s\u1ebd, \"Tr\u01b0\u1eddng\" g\u1ee3i s\u1ef1 to l\u1edbn, v\u1ebb \u0111\u1eb9p bao la. \"Quang Tr\u01b0\u1eddng\" c\u00f3 ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng r\u1ed9ng, d\u00e0i, s\u1ef1 v\u1ebb vang to l\u1edbn. T\u00ean \"Quang Tr\u01b0\u1eddng\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, t\u00e0i tr\u00ed, ki\u00ean c\u01b0\u1eddng, c\u00f3 ch\u00ed h\u01b0\u1edbng, ngay th\u1eb3ng, ch\u00e2n th\u1eadt.", "sex": 3}
