{"first_name": "S\u00e2m Tr\u01b0\u1eddng", "meaning": "Theo t\u1eeb \u0111i\u1ec3n Ti\u1ebfng Vi\u1ec7t, \"Tr\u01b0\u1eddng\" c\u00f3 ngh\u0129a l\u00e0 d\u00e0i, l\u00e2u, xa. \"Tr\u01b0\u1eddng\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd c\u00f3 \u00fd ch\u00ed ki\u00ean c\u01b0\u1eddng, c\u00f3 l\u1eadp tr\u01b0\u1eddng b\u1ec1n v\u1eefng, d\u00f9 c\u00f3 kh\u00f3 kh\u0103n hay v\u1ea5p ng\u00e3 c\u0169ng c\u00f3 th\u1ec3 \u0111\u1ee9ng v\u1eefng. Ngo\u00e0i ra, c\u00f2n c\u00f3 \u00fd ngh\u0129a mong con s\u1ebd m\u1ea1nh kh\u1ecfe v\u00e0 s\u1ed1ng l\u00e2u. \"S\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 \u0111\u1ed3 qu\u00fd b\u00e1u, tr\u00e2n b\u1ea3o, ngo\u00e0i ra c\u00f2n l\u00e0 t\u00ean c\u1ee7a m\u1ed9t lo\u1ea1i c\u1ecf s\u00e2m, l\u00e1 nh\u01b0 c\u00e1i b\u00e0n tay, hoa nh\u1ecf m\u00e0 tr\u1eafng, d\u00f9ng l\u00e0m thu\u1ed1c. T\u00ean \"S\u00e2m Tr\u01b0\u1eddng\" \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u00e0i n\u0103ng c\u00f3 th\u1ec3 gi\u00fap \u00edch cho ng\u01b0\u1eddi cho \u0111\u1eddi, c\u00f3 kh\u00ed ch\u1ea5t m\u1ea1nh m\u1ebd, ki\u00ean c\u01b0\u1eddng.", "sex": 3}
