{"first_name": "L\u00e2m Truy\u1ec1n", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"L\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 r\u1eebng, m\u1ed9t ngu\u1ed3n t\u00e0i nguy\u00ean qu\u00fd c\u00f3 gi\u00e1 tr\u1ecb to l\u1edbn v\u1edbi \u0111\u1eddi s\u1ed1ng. T\u00ean \"L\u00e2m Truy\u1ec1n\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi m\u1ea1nh m\u1ebd, c\u00f3 \u00fd ch\u00ed ki\u00ean c\u01b0\u1eddng. Cha m\u1eb9 g\u1eedi t\u1ea5t c\u1ea3 t\u00ecnh th\u01b0\u01a1ng y\u00eau v\u00e0 c\u1ea7u mong con c\u00f3 \u0111\u01b0\u1ee3c cu\u1ed9c s\u1ed1ng b\u00ecnh y\u00ean v\u00e0 may m\u1eafn", "sex": 3}
{"first_name": "Minh Truy\u1ec1n", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, Minh c\u00f2n c\u00f3 ngh\u0129a ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (b\u00ecnh minh) th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. T\u00ean Minh Truy\u1ec1n d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi th\u00f4ng minh, s\u00e1ng su\u1ed1t, \u0111\u01b0\u1ee3c k\u1ebf th\u1eeba nh\u1eefng \u0111\u1ee9c t\u00ednh t\u1ed1t c\u1ee7a d\u00f2ng t\u1ed9c, mang l\u1ea1i s\u1ef1 v\u1ebb vang, khai s\u00e1ng cho c\u1ea3 d\u00f2ng t\u1ed9c", "sex": 3}
{"first_name": "Ng\u1ecdc Truy\u1ec1n", "meaning": "\"Ng\u1ecdc\" l\u00e0 vi\u00ean ng\u1ecdc, lo\u1ea1i \u0111\u00e1 qu\u00fd c\u00f3 nhi\u1ec1u m\u00e0u s\u1eafc r\u1ef1c r\u1ee1, s\u00e1ng, trong l\u1ea5p l\u00e1nh,... th\u01b0\u1eddng d\u00f9ng l\u00e0m \u0111\u1ed3 trang s\u1ee9c hay trang tr\u00ed. T\u00ean Ng\u1ecdc Truy\u1ec1n l\u00e0 mong mu\u1ed1n con c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, t\u1ecfa s\u00e1ng nh\u01b0 h\u00f2n ng\u1ecdc qu\u00fd, cu\u1ed9c s\u1ed1ng gi\u00e0u sang, ph\u00fa qu\u00fd", "sex": 3}
{"first_name": "Thanh Truy\u1ec1n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 m\u00e0u xanh, tu\u1ed5i tr\u1ebb, c\u00f2n l\u00e0 s\u1ef1 thanh cao, trong s\u1ea1ch, thanh b\u1ea1ch. Ng\u01b0\u1eddi t\u00ean \"Thanh Truy\u1ec1n\" th\u01b0\u1eddng c\u00f3 kh\u00ed ch\u1ea5t \u0111i\u1ec1m \u0111\u1ea1m, nh\u1eb9 nh\u00e0ng v\u00e0 cao qu\u00fd", "sex": 3}
{"first_name": "V\u01b0\u01a1ng Truy\u1ec1n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"V\u01b0\u01a1ng\" c\u00f3 ngh\u0129a l\u00e0 vua, th\u1ed1ng tr\u1ecb thi\u00ean h\u1ea1 d\u01b0\u1edbi th\u1eddi qu\u00e2n ch\u1ee7. \"Truy\u1ec1n\" l\u00e0 \u0111\u1ec3 l\u1ea1i c\u00e1i m\u00ecnh \u0111ang n\u1eafm gi\u1eef cho ng\u01b0\u1eddi kh\u00e1c, th\u01b0\u1eddng thu\u1ed9c th\u1ebf h\u1ec7 sau, l\u00e0 truy\u1ec1n l\u1ea1i t\u1eeb \u0111\u1eddi n\u00e0y sang \u0111\u1eddi kh\u00e1c. V\u01b0\u01a1ng Truy\u1ec1n c\u00f3 \u00fd ngh\u0129a l\u00e0 truy\u1ec1n l\u1ea1i ng\u00f4i vua ho\u1eb7c quy\u1ec1n l\u1ee5c cho \u0111\u1eddi sau. \u0110\u1eb7t t\u00ean con l\u00e0  \"V\u01b0\u01a1ng Truy\u1ec1n\" v\u1edbi th\u00f4ng \u0111i\u1ec7p l\u00e0 cha m\u1eb9 trao h\u1ebft cho con t\u1ea5t c\u1ea3 t\u00ecnh th\u01b0\u01a1ng, c\u0169ng nh\u01b0 ph\u00fac l\u1ed9c c\u1ee7a d\u00f2ng t\u1ed9c cho con, mong con kh\u00f4n l\u1edbn n\u00ean ng\u01b0\u1eddi", "sex": 3}
