{"first_name": "C\u1ea7m T\u00fa", "meaning": "\"C\u1ea7m T\u00fa\" l\u00e0 m\u1ed9t c\u00e2y \u0111\u00e0n \u0111\u1eb9p, kh\u00f4ng ch\u1ec9 l\u00e0 m\u1ed9t nh\u1ea1c c\u1ee5 \u00e2m nh\u1ea1c \u0111\u1ec3 bi\u1ec3u di\u1ec5n m\u00e0 c\u00f2n mang nh\u1eefng \u00fd ngh\u0129a v\u0103n h\u00f3a phong ph\u00fa v\u00e0 uy\u00ean th\u00e2m. \u0110\u1eb7t t\u00ean n\u00e0y cho con, b\u1ed1 m\u1eb9 ng\u1ee5 \u00fd con l\u00e0 ng\u01b0\u1eddi c\u00f3 t\u01b0 t\u01b0\u1edfng ch\u00ednh tr\u1ef1c v\u00e0 suy ngh\u0129 ngay th\u1eb3ng, ph\u1ea9m c\u00e1ch cao qu\u00fd, ti\u1ebft h\u1ea1nh v\u00e0 li\u00eam khi\u1ebft \u0111\u1ec3 \u0111\u1ea1t t\u1edbi s\u1ef1 h\u00e0i ho\u00e0 gi\u1eefa b\u1ea3n th\u1ec3 v\u00e0 t\u00e2m h\u1ed3n.", "sex": 5}
