{"first_name": "Chi T\u00fa", "meaning": "\"T\u00fa\" trong ngh\u0129a H\u00e1n-Vi\u1ec7t l\u00e0 ng\u00f4i sao, v\u00ec tinh t\u00fa l\u1ea5p l\u00e1nh chi\u1ebfu s\u00e1ng tr\u00ean cao. C\u00f2n \"Chi\" nghi\u0303a la\u0300 ca\u0300nh, trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i.  L\u00e0 ch\u1eef Chi trong Kim Chi Ng\u1ecdc Di\u1ec7p \u00fd ch\u1ec9 \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. \u0110\u1eb7t t\u00ean \"Chi T\u00fa\" cho con b\u1ed1 m\u1eb9 ng\u1ea7m \u00fd hi v\u1ecdng con l\u00e0 dung m\u1ea1o xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau.", "sex": 5}
{"first_name": "\u0110an T\u00fa", "meaning": "\"T\u00fa\" c\u00f3 ngh\u0129a l\u00e0 v\u00ec sao l\u1ea5p l\u00e1nh xinh \u0111\u1eb9p, \"\u0110an\" c\u00f3 ngh\u0129a l\u00e0 gi\u1ea3n d\u1ecb, trong s\u00e1ng. \"\u0110an T\u00fa\" mang \u00fd ngh\u0129a con s\u1ebd xinh \u0111\u1eb9p nh\u01b0 v\u00ec tinh t\u00fa tr\u00ean tr\u1eddi v\u1edbi t\u1ea5m l\u00f2ng trong s\u00e1ng, b\u00ecnh d\u1ecb.", "sex": 5}
{"first_name": "D\u00e2ng T\u00fa", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t, \"T\u00fa\" l\u00e0 ng\u00f4i sao, v\u00ec tinh t\u00fa l\u1ea5p l\u00e1nh chi\u1ebfu s\u00e1ng tr\u00ean cao. Ngo\u00e0i ra \"T\u00fa\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 dung m\u1ea1o xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau .\"D\u00e2ng\" l\u00e0 v\u1ebb \u0111\u1eb9p trong s\u00e1ng th\u00e1nh thi\u1ec7n. \"D\u00e2n T\u00fa\", con c\u00f3 t\u00ednh h\u01a1i tr\u1ea7m, s\u00e2u s\u1eafc v\u00e0 d\u1ecbu nh\u1eb9.", "sex": 5}
