{"first_name": "\u0110\u00ecnh T\u00fa", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t \"T\u00fa\" l\u00e0 ng\u00f4i sao, v\u00ec tinh t\u00fa l\u1ea5p l\u00e1nh chi\u1ebfu s\u00e1ng tr\u00ean cao. Ngo\u00e0i ra \"T\u00fa\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 dung m\u1ea1o xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau . \"\u0110\u00ecnh\" th\u1ec3 hi\u1ec7n s\u1ef1 m\u1ea1nh m\u1ebd, v\u1eefng ch\u1eafc \u00fd ch\u1ec9 con l\u00e0 ng\u01b0\u1eddi m\u1ecdi ng\u01b0\u1eddi c\u00f3 th\u1ec3 tr\u00f4ng c\u1eady. \"\u0110\u00ecnh\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 \u1ed5n th\u1ecfa, th\u1ecfa \u0111\u00e1ng th\u1ec3 hi\u1ec7n s\u1ef1 s\u1eafp x\u1ebfp \u00eam \u1ea5m. \"\u0110\u00ecnh T\u00fa\", ba m\u1eb9 mong mu\u1ed1n con lu\u00f4n xinh \u0111\u1eb9p , \u0111\u00e1ng y\u00eau nh\u01b0 nh\u1eefng v\u00ec sao l\u1ea5p l\u00e1nh , v\u00e0 l\u00e0 ng\u01b0\u1eddi con bi\u1ebft chu to\u00e0n m\u1ecdi vi\u1ec7c \u1ed5n th\u1ecfa trong gia \u0111\u00ecnh.", "sex": 5}
