{"first_name": "S\u01a1n T\u00f9ng", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t, \"S\u01a1n\" l\u00e0 n\u00fai, t\u00ednh ch\u1ea5t c\u1ee7a n\u00fai l\u00e0 lu\u00f4n v\u1eefng ch\u00e3i, h\u00f9ng d\u0169ng v\u00e0 tr\u1ea7m t\u0129nh. \"S\u01a1n T\u00f9ng\" la\u0300 c\u00e2y t\u00f9ng xanh t\u01b0\u01a1i tr\u00ean n\u00fai, h\u00ecnh \u1ea3nh n\u00e0y th\u1ec3 hi\u1ec7n cho ng\u01b0\u1eddi con trai t\u00e0i gi\u1ecfi, ki\u00ean c\u01b0\u1eddng v\u01b0\u1ee3t qua m\u1ecdi kh\u00f3 kh\u0103n c\u1ee7a ho\u00e0n c\u1ea3nh m\u00e0 v\u1eabn s\u1ed1ng t\u1ed1t. B\u00f4\u0301 m\u1eb9 mong con h\u00e3y th\u1eadt v\u1eefng ch\u00e3i, ki\u00ean c\u01b0\u1eddng v\u00e0 l\u00e0m ch\u1ed7 d\u1ef1a t\u1ed1t cho gia \u0111\u00ecnh.", "sex": 3}
