{"first_name": "Uy T\u00f9ng", "meaning": "\"T\u00f9ng\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i c\u00e2y trong b\u1ed9 c\u00e2y t\u1ee9 qu\u00fd, \u1edf Vi\u1ec7t Nam c\u00f2n g\u1ecdi l\u00e0 c\u00e2y th\u00f4ng, c\u00e2y b\u00e1ch, m\u1ecdc tr\u00ean n\u00fai \u0111\u00e1 cao, kh\u00f4 c\u1eb1n, sinh tr\u01b0\u1edfng trong \u0111i\u1ec1u ki\u1ec7n kh\u1eafc nghi\u1ec7t m\u00e0 v\u1eabn xanh \u01b0\u01a1m, b\u1ea5t khu\u1ea5t, kh\u00f4ng g\u00e3y, kh\u00f4ng \u0111\u1ed7. \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd. D\u1ef1a theo h\u00ecnh \u1ea3nh m\u1ea1nh m\u1ebd c\u1ee7a c\u00e2y t\u00f9ng, t\u00ean \"Uy T\u00f9ng\" l\u00e0 \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi qu\u00e2n t\u1eed, s\u1ed1ng hi\u00eang ngang, ki\u00ean c\u01b0\u1eddng, v\u1eefng ch\u00e3i trong s\u01b0\u01a1ng gi\u00f3 n\u1eafng m\u01b0a, l\u00e0 ng\u01b0\u1eddi ki\u00ean \u0111\u1ecbnh d\u00e1m ngh\u0129 d\u00e1m l\u00e0m,  s\u1ed1ng c\u00f3 m\u1ee5c \u0111\u00edch l\u00fd t\u01b0\u1edfng.", "sex": 3}
