{"first_name": "B\u1ea3o Tu\u1ec7", "meaning": "\u0110\u00e2y l\u00e0 t\u00ean hay c\u00f3 th\u1ec3 d\u00f9ng cho c\u1ea3 con trai v\u00e0 con g\u00e1i v\u1edbi \"Tu\u1ec7\" ngh\u0129a l\u00e0 tr\u00ed th\u00f4ng minh, tr\u00ed tu\u1ec7. \"B\u1ea3o\" ch\u00ednh l\u00e0 b\u1ea3o v\u1eadt m\u00e0 b\u1ed1 m\u1eb9 lu\u00f4n n\u00e2ng niu, gi\u1eef g\u00ecn. B\u1ed1 m\u1eb9 \u0111\u1eb7t t\u00ean con l\u00e0 \"B\u1ea3o Tu\u1ec7\" v\u1edbi mong mu\u1ed1n \u0111\u1ee9a tr\u1ebb sinh ra s\u1ebd l\u00e0 m\u1ed9t ng\u01b0\u1eddi th\u00f4ng minh t\u00e0i gi\u1ecfi, \u0111\u01b0\u1ee3c m\u1ecdi ng\u01b0\u1eddi y\u00eau th\u01b0\u01a1ng, qu\u00fd tr\u1ecdng.", "sex": 7}
{"first_name": "B\u00ecnh Tu\u1ec7", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t,  \"B\u00ecnh\" c\u00f3 ngh\u0129a l\u00e0 c\u00f4ng b\u1eb1ng, ngang nhau kh\u00f4ng thi\u00ean l\u1ec7ch, c\u00f4ng ch\u00ednh, \"Tu\u1ec7\" c\u00f3 ngh\u0129a l\u00e0 tr\u00ed th\u00f4ng minh, t\u00e0i tr\u00ed. Du\u0300ng t\u00ean \"B\u00ecnh Tu\u1ec7\" \u0111\u0103\u0323t cho con \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7, c\u00f3 n\u0103ng l\u1ef1c, t\u01b0 duy, kh\u00f4n lanh, m\u1eabn ti\u1ec7p. Cha m\u1eb9 mong con s\u1ebd l\u00e0 \u0111\u1ee9a con t\u00e0i gi\u1ecfi, th\u00f4ng minh h\u01a1n ng\u01b0\u1eddi, c\u00f3 c\u1ed1t c\u00e1ch, bi\u1ebft ph\u00e2n \u0111\u1ecbnh r\u1ea1ch r\u00f2i, t\u00ednh kh\u00ed \u00f4n h\u00f2a, bi\u1ebft \u0111i\u1ec1u ph\u1ed1i c\u00f4ng vi\u1ec7c, th\u00e1i \u0111\u1ed9 tr\u01b0\u1edbc cu\u1ed9c s\u1ed1ng lu\u00f4n b\u00ecnh t\u0129nh an \u0111\u1ecbnh.", "sex": 7}
{"first_name": "C\u00e1t Tu\u1ec7", "meaning": "\"Tu\u1ec7\" t\u1ee9c l\u00e0 tr\u00ed tu\u1ec7, s\u1ef1 th\u00f4ng th\u00e1i, hi\u1ec3u bi\u1ebft. \"C\u00e1t\" trong ch\u1eef C\u00e1t T\u01b0\u1eddng \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng s\u1ef1 vi\u1ec7c vui m\u1eebng, mang c\u1ea3m gi\u00e1c h\u00e2n hoan, th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 di\u1ec5n t\u1ea3 nh\u1eefng \u0111i\u1ec1u may m\u1eafn, t\u1ed1t l\u00e0nh. \"C\u00e1t Tu\u1ec7\" n\u00f3i r\u00f5 l\u00ean ni\u1ec1m hi v\u1ecdng c\u1ee7a b\u1ed1 m\u1eb9 \u1edf con l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh v\u00e0 g\u1eb7p nhi\u1ec1u may m\u1eafn trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
{"first_name": "Chi Tu\u1ec7", "meaning": "\"Tu\u1ec7\" t\u1ee9c l\u00e0 tr\u00ed tu\u1ec7, s\u1ef1 th\u00f4ng th\u00e1i, hi\u1ec3u bi\u1ebft. \"Chi\" nghi\u0303a la\u0300 ca\u0300nh, trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i.  L\u00e0 ch\u1eef \"Chi\" trong Kim Chi Ng\u1ecdc Di\u1ec7p \u00fd ch\u1ec9 \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc. \"Chi Tu\u1ec7\" \u00fd ch\u1ec9 mong mu\u1ed1n c\u1ee7a b\u1ed1 m\u1eb9 con l\u00e0 ng\u01b0\u1eddi tinh th\u00f4ng, s\u00e1ng d\u1ea1.", "sex": 5}
{"first_name": "Giang Tu\u1ec7", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t, \"Tu\u1ec7\" c\u00f3 ngh\u0129a l\u00e0 tr\u00ed th\u00f4ng minh, t\u00e0i tr\u00ed. T\u00ean \"Tu\u1ec7\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7, c\u00f3 n\u0103ng l\u1ef1c, t\u01b0 duy, kh\u00f4n lanh, m\u1eabn ti\u1ec7p. Cha m\u1eb9 mong con s\u1ebd l\u00e0 \u0111\u1ee9a con t\u00e0i gi\u1ecfi, th\u00f4ng minh h\u01a1n ng\u01b0\u1eddi.\"Giang\" l\u00e0 d\u00f2ng s\u00f4ng, th\u01b0\u1eddng ch\u1ec9 nh\u1eefng \u0111i\u1ec1u cao c\u1ea3, l\u1edbn lao. \"Giang Tu\u1ec7\" con l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh t\u00e0i tr\u00ed, c\u00f3 t\u01b0 duy t\u1ed1t, cu\u1ed9c s\u1ed1ng c\u00f3 l\u00fac th\u0103ng tr\u1ea7m nh\u01b0ng con lu\u00f4n bi\u1ebft v\u01b0\u1ee3t qua v\u00e0 s\u1ed1ng h\u1ea1nh ph\u00fac.", "sex": 5}
{"first_name": "H\u1eefu Tu\u1ec7", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, \"H\u1eefu Tu\u1ec7\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7. \"H\u1eefu Tu\u1ec7\" l\u00e0 c\u00e1i t\u00ean mang \u00fd ngh\u0129a ng\u01b0\u1eddi c\u00f3 t\u00e0i n\u0103ng, th\u00f4ng minh, hi\u1ec3u bi\u1ebft, s\u00e1ng d\u1ea1. Cha m\u1eb9 mong con s\u1ebd lu\u00f4n ph\u00e1t huy tr\u00ed tu\u1ec7 c\u1ee7a m\u00ecnh \u0111\u1ec3 cha\u0323m t\u01a1\u0301i s\u01b0\u0323 th\u00e0nh c\u00f4ng, th\u00e0nh \u0111\u1ea1t.", "sex": 3}
{"first_name": "L\u00e2m Tu\u1ec7", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, \"L\u00e2m\" l\u00e0 r\u1eebng, \"Tu\u1ec7\" l\u00e0 tr\u00ed tu\u1ec7, s\u1ef1 th\u00f4ng th\u00e1i, hi\u1ec3u bi\u1ebft. \"L\u00e2m Tu\u1ec7\" c\u00f3 ngh\u0129a l\u00e0 c\u00f3 t\u1ea7m hi\u1ec3u bi\u1ebft r\u1ed9ng l\u1edbn, s\u00e2u s\u1eafc. T\u00ean \"L\u00e2m Tu\u1ec7\" c\u00f3 th\u1ec3 \u0111\u01b0\u1ee3c hi\u1ec3u l\u00e0 s\u1ef1 mong mu\u1ed1n con c\u00e1i khi l\u1edbn l\u00ean s\u1ebd th\u00f4ng minh, l\u00e0 ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft s\u00e2u r\u1ed9ng.", "sex": 3}
{"first_name": "L\u01b0\u01a1ng Tu\u1ec7", "meaning": "Tu\u1ec7 trong H\u00e1n Vi\u1ec7t ngh\u0129a l\u00e0 th\u00f4ng minh, tr\u00ed tu\u1ec7, hi\u1ec3u bi\u1ebft am t\u01b0\u1eddng & L\u01b0\u01a1ng \u00fd l\u00e0 l\u01b0\u01a1ng thi\u1ec7n, nh\u00e2n h\u1eadu, hi\u1ec1n h\u00f2a. T\u00ean L\u01b0\u01a1ng Tu\u1ec7 mang \u00fd ngh\u0129a con \u0111\u01b0\u1ee3c h\u1ed9i \u0111\u1ee7 nh\u1eefng \u0111\u1ee9c t\u00ednh t\u1ed1t \u0111\u1eb9p, v\u1eeba th\u00f4ng minh lanh l\u1ee3i, hi\u1ec3u bi\u1ebft v\u1eeba nh\u00e2n \u00e1i, bi\u1ebft c\u00e1ch c\u01b0 x\u1eed", "sex": 5}
{"first_name": "M\u1eabn Tu\u1ec7", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"M\u1eabn\" l\u00e0 nhanh nh\u1eb9n, s\u00e1ng su\u1ed1t, hi\u1ec3u bi\u1ebft, \"Tu\u1ec7\" l\u00e0 tr\u00ed tu\u1ec7 ch\u1ec9 s\u1ef1 th\u00f4ng minh, s\u00e1ng su\u1ed1t, c\u00f3 h\u1ecdc th\u1ee9c, uy\u00ean b\u00e1c. \"M\u1eabn Tu\u1ec7\" l\u00e0 c\u00e1i t\u00ean g\u1ee3i l\u00ean s\u1ef1 th\u00f4ng minh, nhanh nh\u1ea1y, s\u1eafc s\u1ea3o v\u00e0 s\u00e1ng su\u1ed1t.", "sex": 5}
{"first_name": "Mi\u00ean Tu\u1ec7", "meaning": "\"Mi\u00ean\" l\u00e0 tri\u1ec1n mi\u00ean kh\u00f4ng d\u1ee9t. \"Tu\u1ec7\" l\u00e0 tr\u00ed tu\u1ec7, \u00fd n\u00f3i con th\u00f4ng minh, s\u00e1ng su\u1ed1t. \"Mi\u00ean Tu\u1ec7\" mang \u00fd ngh\u0129a con c\u1ee7a cha m\u1eb9 s\u1ebd th\u00f4ng th\u00e1i, minh m\u1eabn, c\u00f3 tr\u00ed tu\u1ec7 h\u01a1n ng\u01b0\u1eddi, gi\u1ecfi giang su\u1ed1t c\u1ea3 \u0111\u1eddi.", "sex": 5}
{"first_name": "Minh Tu\u1ec7", "meaning": "\"Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"\"Minh\"\" ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, \"\"Tu\u1ec7\"\" ngh\u0129a l\u00e0 tr\u00ed th\u00f4ng minh, tr\u00ed tu\u1ec7. T\u00ean \"\"Minh Tu\u1ec7\"\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, s\u00e1ng d\u1ea1, t\u00e2m tr\u00ed \u0111\u01b0\u1ee3c khai s\u00e1ng.\r\nCha m\u1eb9 \u0111\u1eb7t t\u00ean con th\u1ebf n\u00e0y v\u1edbi mong mu\u1ed1n \u0111\u1ee9a tr\u1ebb sinh ra s\u1ebd l\u00e0 m\u1ed9t ng\u01b0\u1eddi r\u1ea5t th\u00f4ng minh, t\u00e0i gi\u1ecfi.\"", "sex": 3}
{"first_name": "M\u1ef9 Tu\u1ec7", "meaning": "\"M\u1ef9\" c\u00f3 ngh\u0129a l\u00e0 xinh \u0111\u1eb9p, t\u1ed1t l\u00e0nh theo ki\u1ec3u nh\u1eb9 nh\u00e0ng m\u1ec1m m\u1ea1i. \"Tu\u1ec7\" l\u00e0 tr\u00ed tu\u1ec7, th\u00f4ng minh, gi\u1ecfi giang. \"M\u1ef9 Tu\u1ec7\" ngh\u0129a l\u00e0 con th\u00f4ng minh, c\u00f3 tr\u00ed tu\u1ec7, gi\u1ecfi giang v\u00e0 xinh \u0111\u1eb9p.", "sex": 5}
{"first_name": "Nam Tu\u1ec7", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Tu\u1ec7 th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7, c\u00f3 n\u0103ng l\u1ef1c, t\u01b0 duy, kh\u00f4n lanh, m\u1eabn ti\u1ec7p. Cha m\u1eb9 mong con s\u1ebd l\u00e0 \u0111\u1ee9a con t\u00e0i gi\u1ecfi, th\u00f4ng minh h\u01a1n ng\u01b0\u1eddi", "sex": 3}
{"first_name": "Nga Tu\u1ec7", "meaning": "\"Nga\" l\u00e0 t\u1eeb hoa m\u1ef9 d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p, th\u01b0\u1edbt tha xinh nh\u01b0 ti\u00ean. \"Tu\u1ec7\" l\u00e0 tr\u00ed tu\u1ec7, th\u00f4ng minh. \"Nga Tu\u1ec7\" l\u00e0 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p th\u00f4ng minh tr\u00ed tu\u1ec7 h\u01a1n ng\u01b0\u1eddi.", "sex": 5}
{"first_name": "Nguy\u1ec7t Tu\u1ec7", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, nguy\u1ec7t l\u00e0 v\u1ea7ng tr\u0103ng, Tr\u0103ng c\u00f3 v\u1ebb \u0111\u1eb9p v\u00f4 c\u00f9ng b\u00ecnh d\u1ecb, m\u1ed9t v\u1ebb \u0111\u1eb9p kh\u00f4ng c\u1ea7n trang s\u1ee9c, \u0111\u1eb9p m\u1ed9t c\u00e1ch v\u00f4 t\u01b0, h\u1ed3n nhi\u00ean. Tr\u0103ng t\u01b0\u1ee3ng tr\u01b0ng cho v\u1ebb \u0111\u1eb9p h\u1ed3n nhi\u00ean n\u00ean tr\u0103ng ho\u00e0 v\u00e0o thi\u00ean nhi\u00ean, ho\u00e0 v\u00e0o c\u00e2y c\u1ecf. T\u00ean Nguy\u1ec7t Tu\u1ec7 g\u1ee3i \u0111\u1ebfn ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, th\u00f4ng minh, tinh anh, gi\u1ea3n d\u1ecb, vui t\u01b0\u01a1i, h\u1ed3n nhi\u00ean", "sex": 5}
{"first_name": "Nh\u00e3 Tu\u1ec7", "meaning": "\"Nh\u00e3\" l\u00e0 nh\u00e3 nh\u1eb7n, \u0111\u1eb9p nh\u01b0ng \u0111\u01a1n gi\u1ea3n, kh\u00f4ng c\u1ea7u k\u1ef3, ph\u00f4 tr\u01b0\u01a1ng. \"Tu\u1ec7\" c\u00f3 ngh\u0129a l\u00e0 tr\u00ed th\u00f4ng minh, t\u00e0i tr\u00ed. T\u00ean \"Nh\u00e3 Tu\u1ec7\" l\u00e0 s\u1ef1 k\u1ebft h\u1ee3p tinh t\u1ebf v\u1ec1 t\u00e0i v\u00e0 s\u1eafc, mang \u00fd ngh\u0129a con v\u1eeba xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau, t\u00ednh c\u00e1ch khi\u00eam nh\u01b0\u1eddng, l\u1ea1i v\u1eeba t\u00e0i n\u0103ng, hi\u1ec3u bi\u1ebft, gi\u1ecfi giang h\u01a1n ng\u01b0\u1eddi", "sex": 5}
