{"first_name": "Am T\u01b0\u1eddng", "meaning": "\"Am T\u01b0\u1eddng\"  c\u00f3 ngh\u0129a l\u00e0 bi\u1ebft r\u00f5 ng\u1ecdn g\u1ed1c, c\u0103n nguy\u00ean, \u00fd ch\u1ec9 con s\u1ebd l\u00e0 ng\u01b0\u1eddi th\u1ea5u \u0111\u00e1o, s\u00e1ng s\u1ee7a. \u0110\u1eb7t t\u00ean \"Am T\u01b0\u1eddng\" cho con l\u00e0 mong con s\u1ebd l\u00e0 m\u1ed9t \u0111\u1ee9a b\u00e9 th\u00f4ng minh, hi\u1ec3u bi\u1ebft, gi\u1ecfi giang", "sex": 7}
{"first_name": "An T\u01b0\u1eddng", "meaning": "\"An\" l\u00e0 y\u00ean \u0111\u1ecbnh, \"An T\u01b0\u1eddng\" l\u00e0 minh b\u1ea1ch s\u1ef1 y\u00ean \u0111\u1ecbnh, ch\u1ec9 con ng\u01b0\u1eddi th\u00e1o v\u00e1t t\u00e0i n\u0103ng.", "sex": 5}
{"first_name": "B\u00e1ch T\u01b0\u1eddng", "meaning": "\"T\u01b0\u1eddng\" l\u00e0 th\u1ea5u su\u1ed1t. \"B\u00e1ch\" l\u00e0 tr\u0103m. \"B\u00e1ch T\u01b0\u1eddng\" \u0111\u01b0\u1ee3c hi\u1ec3u l\u00e0 ng\u01b0\u1eddi ki\u1ebfn th\u1ee9c uy\u00ean th\u00e2m, th\u00f4ng tri b\u00e1c h\u1ecdc.", "sex": 3}
{"first_name": "C\u00e1t T\u01b0\u1eddng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"C\u00e1t\" (Hay c\u00f2n g\u1ecdi l\u00e0 \"Ki\u1ebft\") c\u00f3 ngh\u0129a l\u00e0 t\u1ed1t l\u00e0nh, \"T\u01b0\u1eddng\" c\u00f3 ngh\u0129a l\u00e0 \u0111i\u1ec1u may m\u1eafn, ph\u01b0\u1edbc l\u00e0nh. \"C\u00e1t T\u01b0\u1eddng\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng \u0111i\u1ec1u t\u1ed1t l\u00e0nh, s\u1ef1 vi\u00ean m\u00e3n, h\u1ea1nh ph\u00fac. \u0110\u1eb7t t\u00ean con l\u00e0 \"C\u00e1t T\u01b0\u1eddng\" th\u1ec3 hi\u1ec7n ni\u1ec1m tin c\u1ee7a ba m\u1eb9 r\u1eb1ng con ch\u00ednh l\u00e0 s\u1ef1 may m\u1eafn c\u1ee7a gia \u0111\u00ecnh, \u0111\u1ed3ng th\u1eddi c\u0169ng mong mu\u1ed1n nh\u1eefng \u0111i\u1ec1u t\u1ed1t l\u00e0nh, may m\u1eafn s\u1ebd \u0111\u1ebfn v\u1edbi con.", "sex": 5}
{"first_name": "Chi T\u01b0\u1eddng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"T\u01b0\u1eddng\" c\u00f3 ngh\u0129a l\u00e0 tinh t\u01b0\u1eddng, am hi\u1ec3u, bi\u1ebft r\u00f5.  \"Chi\" nghi\u0303a la\u0300 ca\u0300nh, trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i. T\u00ean \"Chi T\u01b0\u1eddng\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, s\u00e1ng su\u1ed1t, c\u00f3 t\u01b0 duy, c\u00f3 t\u00e0i n\u0103ng. Ngo\u00e0i ra \"T\u01b0\u1eddng\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u00e0nh, m\u1ecdi \u0111i\u1ec1u t\u1ed1t l\u00e0nh, may m\u1eafn s\u1ebd \u0111\u1ebfn v\u1edbi con.", "sex": 5}
{"first_name": "Di\u1ec5m T\u01b0\u1eddng", "meaning": "\"Di\u1ec5m\" theo ti\u1ebfng h\u00e1n - vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 s\u1ef1 t\u1ed1t \u0111\u1eb9p, v\u1ebb t\u01b0\u01a1i s\u00e1ng, xinh \u0111\u1eb9p l\u1ed9ng l\u1eaby. \"T\u01b0\u1eddng\" c\u00f3 ngh\u0129a l\u00e0 tinh t\u01b0\u1eddng, th\u00f4ng minh, am hi\u1ec3u. T\u00ean \"Di\u1ec5m T\u01b0\u1eddng\" th\u01b0\u1eddng ng\u1ee5 \u00fd ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p, y\u1ec3u \u0111i\u1ec7u, c\u00f3 tr\u00ed th\u00f4ng minh, tinh anh", "sex": 5}
{"first_name": "Di\u00ean T\u01b0\u1eddng", "meaning": "\"T\u01b0\u1eddng\" l\u00e0 r\u00f5 r\u00e0ng, minh b\u1ea1ch. \"Di\u00ean T\u01b0\u1eddng\" l\u00e0 s\u1ef1 th\u1eadt r\u00f5 r\u00e0ng, ng\u1ee5 \u00fd ng\u01b0\u1eddi trung th\u1ef1c, s\u00e1ng t\u1ecf, nghi\u00eam t\u00fac.", "sex": 5}
{"first_name": "Du T\u01b0\u1eddng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"T\u01b0\u1eddng\" c\u00f3 ngh\u0129a l\u00e0 tinh t\u01b0\u1eddng, am hi\u1ec3u, bi\u1ebft r\u00f5. T\u00ean \"T\u01b0\u1eddng\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, s\u00e1ng su\u1ed1t, c\u00f3 t\u01b0 duy, c\u00f3 t\u00e0i n\u0103ng. Ngo\u00e0i ra \"T\u01b0\u1eddng\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u00e0nh, m\u1ecdi \u0111i\u1ec1u t\u1ed1t l\u00e0nh, may m\u1eafn s\u1ebd \u0111\u1ebfn v\u1edbi con.\"Du\"ngh\u0129a l\u00e0 hay \u0111i \u0111\u1ed9ng, kh\u00f4ng \u1edf ch\u1ed7 nh\u1ea5t \u0111\u1ecbnh,c\u00f3 th\u1ec3 \u0111i ngao du \u0111\u00e2y \u0111\u00f3, kh\u00e1m ph\u00e1 kh\u1eafp n\u01a1i.\"Du T\u01b0\u1eddng\", ba m\u1eb9 mong mu\u1ed1n con l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh t\u00e0i gi\u1ecfi xu\u1ea5t ch\u00fang,t\u01b0\u01a1ng lai g\u1eb7p nhi\u1ec1u \u0111i\u1ec1u t\u1ed1t l\u00e0nh v\u00e0 may m\u1eafn.", "sex": 5}
{"first_name": "Duy\u00ean T\u01b0\u1eddng", "meaning": "\"T\u01b0\u1eddng\" l\u00e0 may m\u1eafn. \"Duy\u00ean T\u01b0\u1eddng\" l\u00e0 ng\u01b0\u1eddi con g\u00e1i h\u1ea1nh ph\u1eadn t\u1ed1t l\u00e0nh, cu\u1ed9c s\u1ed1ng nh\u01b0 \u00fd.", "sex": 5}
{"first_name": "Gia T\u01b0\u1eddng", "meaning": "Gia theo ti\u1ebfng H\u00e1n - Vi\u1ec7t  l\u00e0 lo\u00e0i c\u1ecf lau, mang l\u1ea1i \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p, ph\u00fac l\u00e0nh. \"Gia\" trong ngh\u0129a H\u00e1n-Vi\u1ec7t c\u00f2n l\u00e0 gia \u0111\u00ecnh, l\u00e0 m\u00e1i nh\u00e0 n\u01a1i m\u1ecdi ng\u01b0\u1eddi sum v\u1ea7y, sinh ho\u1ea1t b\u00ean nhau. T\u01b0\u1eddng c\u00f3 ngh\u0129a l\u00e0 tinh t\u01b0\u1eddng, th\u00f4ng minh, am hi\u1ec3u, tinh th\u00f4ng m\u1ecdi vi\u1ec7c. T\u00ean \"Gia T\u01b0\u1eddng\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi ni\u1ec1m hu v\u1ecdng c\u1ee7a c\u1ea3 gia \u0111\u00ecnh con s\u1ebd l\u00e0 ng\u01b0\u1eddi gi\u1ecfi giang, c\u00f3 h\u1ecdc th\u1ee9c v\u00e0 lu\u00f4n bi\u1ebft c\u00e1ch \u0111\u1ed1i nh\u00e2n x\u1eed th\u1ebf", "sex": 3}
{"first_name": "Giao T\u01b0\u1eddng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"T\u01b0\u1eddng\" c\u00f3 ngh\u0129a l\u00e0 tinh t\u01b0\u1eddng, am hi\u1ec3u, bi\u1ebft r\u00f5. \"Giao\" l\u00e0 t\u00ean c\u1ee7a lo\u00e0i c\u1ecf giao mong manh,  b\u00ecnh d\u1ecb, m\u1ea1nh m\u1ebd, \u00fd ch\u00ed. T\u00ean \"Giao T\u01b0\u1eddng\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, s\u00e1ng su\u1ed1t, c\u00f3 t\u01b0 duy, c\u00f3 t\u00e0i n\u0103ng, c\u00f3 \u00fd ch\u00ed, m\u1ea1nh m\u1ebd kh\u00f4ng d\u1ec5 \u0111\u1ea7u h\u00e0ng.", "sex": 5}
{"first_name": "H\u1ea1nh T\u01b0\u1eddng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, c\u1ea3 \"H\u1ea1nh\" v\u00e0 \"T\u01b0\u1eddng\" \u0111\u1ec1u d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng \u0111i\u1ec1u t\u1ed1t l\u00e0nh, may m\u1eafn. T\u00ean \"H\u1ea1nh T\u01b0\u1eddng\" th\u1ec3 hi\u1ec7n mong mu\u1ed1n c\u1ee7a cha m\u1eb9 mong con s\u1ebd g\u1eb7p \u0111\u01b0\u1ee3c nhi\u1ec1u may m\u1eafn v\u00e0 h\u1ea1nh ph\u00fac trong su\u1ed1t cu\u1ed9c \u0111\u1eddi, va\u0300 con l\u00e0 ng\u01b0\u1eddi \u0111em l\u1ea1i may m\u1eafn cho gia \u0111\u00ecnh ta.", "sex": 5}
{"first_name": "L\u00e2n T\u01b0\u1eddng", "meaning": "T\u00ean \"L\u00e2n T\u01b0\u1eddng\" bao g\u1ed3m ch\u1eef \"T\u01b0\u1eddng\" trong am t\u01b0\u1eddng, t\u01b0\u1eddng t\u1eadn & ch\u1eef \"L\u00e2n\" c\u1ee7a K\u1ef3 L\u00e2n. T\u00ean n\u00e0y th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi s\u1ee9c m\u1ea1nh uy v\u0169, tr\u00ed tu\u1ec7 s\u00e1ng su\u1ed1t,bi\u1ebft nh\u00ecn nh\u1eadn th\u1ea5u \u0111\u00e1o s\u1ef1 vi\u1ec7c & s\u1ed1ng li\u00eam ch\u00ednh.", "sex": 3}
{"first_name": "Minh T\u01b0\u1eddng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u00eat, \"Minh\" v\u00e0 \"T\u01b0\u1eddng\" \u0111\u1ec1u c\u00f3 ngh\u0129a l\u00e0 th\u00f4ng minh, tinh t\u01b0\u1eddng, am hi\u1ec3u. \u0110\u1eb7t con t\u00ean \"Minh T\u01b0\u1eddng\" l\u00e0 c\u1ea7u mong con c\u00f3 tr\u00ed tu\u1ec7 tinh th\u00f4ng, h\u1ecdc r\u1ed9ng bi\u1ebft nhi\u1ec1u, nhanh nh\u1eb9n, th\u00f4ng minh, t\u01b0\u01a1ng lai t\u01b0\u01a1i s\u00e1ng", "sex": 3}
{"first_name": "Nam T\u01b0\u1eddng", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam T\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con th\u00f4ng minh, tinh t\u01b0\u1eddng, g\u1eb7p nhi\u1ec1u may m\u1eafn, b\u00ecnh an", "sex": 3}
{"first_name": "Ng\u00e2n T\u01b0\u1eddng", "meaning": "\"Ng\u00e2n\" l\u00e0 ti\u1ec1n c\u1ee7a. \"T\u01b0\u1eddng\" l\u00e0 am hi\u1ec3u, th\u1ea5u \u0111\u00e1o. \"Ng\u00e2n T\u01b0\u1eddng\" l\u00e0 con l\u00e0 ng\u01b0\u1eddi th\u1ea5u \u0111\u00e1o, bi\u1ebft suy t\u00ednh, am hi\u1ec3u m\u1ecdi vi\u1ec7c, c\u00f3 cu\u1ed9c s\u1ed1ng gi\u00e0u sang.", "sex": 5}
{"first_name": "Nh\u00e2n T\u01b0\u1eddng", "meaning": "Nh\u00e2n trong ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ng\u01b0\u1eddi, thi\u00ean ch\u1ec9 v\u1ec1 ph\u1ea7n t\u00ednh c\u00e1ch v\u00ec Nh\u00e2n c\u00f2n c\u00f3 ngh\u0129a l\u00e0 ph\u1ea7n gi\u00e1 tr\u1ecb c\u1ed1t l\u00f5i b\u00ean trong. \"T\u01b0\u1eddng\" c\u00f3 ngh\u0129a l\u00e0 am hi\u1ec3u, tinh t\u01b0\u1eddng, th\u00f4ng su\u1ed1t. T\u00ean \"Nh\u00e2n T\u01b0\u1eddng\" \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n con s\u1ebd th\u00f4ng minh, t\u00e0i gi\u1ecfi, nh\u00e2n h\u1eadu, l\u01b0\u01a1ng thi\u1ec7n, bi\u1ebft y\u00eau th\u01b0\u01a1ng, lu\u00f4n l\u00e0m vi\u1ec7c t\u1ed1t \u0111\u1ec3 h\u01b0\u1edfng qu\u1ea3 ng\u1ecdt.", "sex": 3}
{"first_name": "Nh\u1eadt T\u01b0\u1eddng", "meaning": "\"T\u01b0\u1eddng\" l\u00e0 am hi\u1ec3u, tinh t\u01b0\u1eddng. \"Nh\u1eadt\" l\u00e0 m\u1eb7t tr\u1eddi \u00fd n\u00f3i s\u00e1ng ch\u00f3i, th\u00f4ng minh. \"Nh\u1eadt T\u01b0\u1eddng\" mang \u00fd ngh\u0129a con th\u00f4ng minh, am t\u01b0\u1eddng, hi\u1ec3u bi\u1ebft s\u00e2u s\u1eafc, c\u1eb7n k\u1ebd, l\u00e0 ng\u01b0\u1eddi gi\u1ecfi giang.", "sex": 3}
{"first_name": "Nhi T\u01b0\u1eddng", "meaning": "\"Nhi T\u01b0\u1eddng\" ngh\u0129a l\u00e0 \u0111\u1ee9a con am t\u01b0\u1eddng, tinh th\u00f4ng m\u1ecdi vi\u1ec7c, \u00fd n\u00f3i cha m\u1eb9 mong con th\u00f4ng minh, bi\u1ebft suy ngh\u0129 th\u1ea5u \u0111\u00e1o s\u1ef1 vi\u1ec7c.", "sex": 5}
{"first_name": "Ni T\u01b0\u1eddng", "meaning": "\"T\u01b0\u1eddng\" l\u00e0 am hi\u1ec3u, tinh t\u01b0\u1eddng. \"Ni T\u01b0\u1eddng\" l\u00e0 s\u1ef1 \u1ea5m \u00e1p c\u1eadn k\u1ec1, r\u00f5 r\u00e0ng.", "sex": 5}
{"first_name": "Th\u00fay T\u01b0\u1eddng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Th\u00fay\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn vi\u00ean ng\u1ecdc \u0111\u1eb9p, ng\u1ecdc qu\u00fd.  \"T\u01b0\u1eddng\" c\u00f3 ngh\u0129a l\u00e0 tinh th\u00f4ng, am hi\u1ec3u, d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn nh\u1eefng ng\u01b0\u1eddi c\u00f3 h\u1ecdc th\u1ee9c. T\u00ean \"Th\u00fay T\u01b0\u1eddng\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, th\u00f4ng minh, quy\u1ec1n qu\u00fd, \u0111\u01b0\u1ee3c tr\u00e2n tr\u1ecdng v\u00e0 n\u00e2ng niu", "sex": 5}
{"first_name": "Uy T\u01b0\u1eddng", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"T\u01b0\u1eddng\" c\u00f3 ngh\u0129a l\u00e0 tinh t\u01b0\u1eddng, am hi\u1ec3u, bi\u1ebft r\u00f5. \"Uy\" l\u00e0 quy\u1ec1n uy,  th\u1ec3 hi\u1ec7n s\u1ef1 to l\u1edbn, m\u1ea1nh m\u1ebd. T\u00ean \"Uy T\u01b0\u1eddng\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, s\u00e1ng su\u1ed1t, c\u00f3 t\u01b0 duy, c\u00f3 t\u00e0i n\u0103ng. Ngo\u00e0i ra c\u00f2n l\u00e0 ng\u01b0\u1eddi \u0111\u1ea7y b\u1ea3n l\u0129nh, hi\u00ean ngang.", "sex": 3}
{"first_name": "Uy\u00ean T\u01b0\u1eddng", "meaning": "Theo ngh\u0129a H\u00e1n-Vi\u1ec7t, \"T\u01b0\u1eddng\" c\u00f3 ngh\u0129a l\u00e0 tinh t\u01b0\u1eddng, am hi\u1ec3u, bi\u1ebft r\u00f5. \"Uy\u00ean\"  \u00fd ch\u1ec9 m\u1ed9t c\u00f4 g\u00e1i duy\u00ean d\u00e1ng, th\u00f4ng minh v\u00e0 xinh \u0111\u1eb9p, c\u00f3 t\u1ed1 ch\u1ea5t cao sang, qu\u00fd ph\u00e1i.  T\u00ean \"Uy\u00ean T\u01b0\u1eddng\" d\u00f9ng \u0111\u1ec3 n\u00f3i \u0111\u1ebfn ng\u01b0\u1eddi th\u00f4ng minh, s\u00e1ng su\u1ed1t, c\u00f3 t\u01b0 duy, c\u00f3 t\u00e0i n\u0103ng. Ngo\u00e0i ra \"Uy\u00ean T\u01b0\u1eddng\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 l\u00e0nh, m\u1ecdi \u0111i\u1ec1u t\u1ed1t l\u00e0nh, may m\u1eafn s\u1ebd \u0111\u1ebfn v\u1edbi con.", "sex": 5}
