{"first_name": "Huy T\u01b0\u1edfng", "meaning": "\"Huy\" l\u00e0 s\u00e1ng t\u1ecf. \"Huy T\u01b0\u1edfng\" l\u00e0 suy ngh\u0129 t\u1ecf t\u01b0\u1eddng, ch\u1ec9 con ng\u01b0\u1eddi tr\u00ed tu\u1ec7 ph\u00e2n minh, ph\u1ea9m ch\u1ea5t t\u1ed1t \u0111\u1eb9p.", "sex": 3}
