{"first_name": "B\u1ea3o Tuy\u00ean", "meaning": "Ch\u1eef B\u1ea3o theo ngh\u0129a H\u00e1n - Vi\u1ec7t th\u01b0\u1eddng g\u1eafn li\u1ec1n v\u1edbi nh\u1eefng v\u1eadt tr\u00e2n qu\u00fd nh\u01b0 ch\u00e2u b\u00e1u, qu\u1ed1c b\u1ea3o.T\u00ean \"B\u1ea3o Tuy\u00ean\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con nh\u01b0 h\u00e0m \u00fd con ch\u00ednh l\u00e0 b\u1ea3o v\u1eadt m\u00e0 b\u1ed1 m\u1eb9 lu\u00f4n n\u00e2ng niu, gi\u1eef g\u00ecn. B\u00ean c\u1ea1nh, t\u00ean \"B\u1ea3o\" c\u00f2n \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7 tinh th\u00f4ng, c\u00f3 cu\u1ed9c s\u1ed1ng vinh hoa ph\u00fa qu\u00fd", "sex": 7}
{"first_name": "B\u00ecnh Tuy\u00ean", "meaning": "\"Tuy\u00ean\" l\u00e0 tr\u00ed tu\u1ec7 tinh th\u00f4ng, s\u00e1ng su\u1ed1t, bi\u1ebft c\u00e1ch truy\u1ec1n \u0111\u1ea1t v\u00e0 ti\u1ebfp thu \u00fd t\u01b0\u1edfng. \"B\u00ecnh\"c\u00f3 ngh\u0129a l\u00e0 c\u00f4ng b\u1eb1ng, ngang nhau kh\u00f4ng thi\u00ean l\u1ec7ch, c\u00f4ng ch\u00ednh.T\u00ean \"Bi\u0300nh Tuy\u00ean\" g\u1ee3i \u0111\u1ebfn h\u00ecnh \u1ea3nh ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, th\u00f4ng minh.", "sex": 5}
{"first_name": "H\u00e0 Tuy\u00ean", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"H\u00e0\" c\u00f3 ngh\u0129a l\u00e0 s\u00f4ng, l\u00e0 n\u01a1i kh\u01a1i ngu\u1ed3n cho m\u1ed9t cu\u1ed9c s\u1ed1ng d\u1ea1t d\u00e0o, sinh \u0111\u1ed9ng. T\u00ean \"H\u00e0 Tuy\u00ean\" th\u01b0\u1eddng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi m\u1ec1m m\u1ea1i hi\u1ec1n h\u00f2a nh\u01b0 con s\u00f4ng m\u00f9a n\u01b0\u1edbc n\u1ed5i m\u00eanh mang, b\u1ea1t ng\u00e0n. \"H\u00e0 Tuy\u00ean\" c\u00f2n \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, t\u00e2m t\u00ednh trong s\u00e1ng", "sex": 5}
{"first_name": "H\u1ea3i Tuy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n, \"H\u1ea3i\" c\u00f3 ngh\u0129a l\u00e0 bi\u1ec3n, th\u1ec3 hi\u1ec7n s\u1ef1 r\u1ed9ng l\u1edbn, bao la, g\u1ee3i \u0111\u1ebfn h\u00ecnh \u1ea3nh m\u00eanh m\u00f4ng c\u1ee7a bi\u1ec3n c\u1ea3, m\u1ed9t c\u1ea3nh thi\u00ean nhi\u00ean kh\u00e1 quen thu\u1ed9c v\u1edbi cu\u1ed9c s\u1ed1ng con ng\u01b0\u1eddi. T\u00ean \"H\u1ea3i Tuy\u00ean\" c\u0169ng th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7 tinh th\u00f4ng, t\u00ednh c\u00e1ch kho\u00e1ng \u0111\u1ea1t, bao dung, r\u1ed9ng l\u1edbn nh\u01b0 bi\u1ec3n kh\u01a1i", "sex": 7}
{"first_name": "H\u1ea1nh Tuy\u00ean", "meaning": "Theo H\u00e1n - Vi\u1ec7t, t\u00ean \"H\u1ea1nh\" th\u1ee9 nh\u1ea5t, c\u00f3 ngh\u0129a l\u00e0 may m\u1eafn, l\u00e0 ph\u00fac l\u1ed9c, l\u00e0 ph\u01b0\u1edbc l\u00e0nh. Ngh\u0129a th\u1ee9 hai l\u00e0 n\u00f3i v\u1ec1 m\u1eb7t \u0111\u1ea1o \u0111\u1ee9c, t\u00ednh n\u1ebft c\u1ee7a con ng\u01b0\u1eddi. T\u00ean \"H\u1ea1nh Tuy\u00ean\" th\u01b0\u1eddng d\u00f9ng cho n\u1eef, ch\u1ec9 ng\u01b0\u1eddi n\u1ebft na, t\u00e2m t\u00ednh hi\u1ec1n h\u00f2a, \u0111\u00f4n h\u1eadu, ph\u1ea9m ch\u1ea5t cao \u0111\u1eb9p, tr\u00ed tu\u1ec7 tinh th\u00f4ng", "sex": 5}
{"first_name": "H\u1ed3ng Tuy\u00ean", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"H\u1ed3ng\" l\u00e0 \u00fd ch\u1ec9 m\u00e0u \u0111\u1ecf , m\u00e0 m\u00e0u \u0111\u1ecf v\u1ed1n th\u1ec3 hi\u1ec7n cho ni\u1ec1m vui, s\u1ef1 may m\u1eafn, c\u00e1t t\u01b0\u1eddng. Theo th\u00f3i quen \u0111\u1eb7t t\u00ean c\u1ee7a ng\u01b0\u1eddi Vi\u1ec7t, t\u00ean H\u1ed3ng th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con g\u00e1i v\u00ec \u0111\u00e2y c\u00f2n l\u00e0 t\u00ean m\u1ed9t lo\u1ea1i hoa xinh \u0111\u1eb9p lu\u00f4n ng\u1eddi s\u1eafc h\u01b0\u01a1ng. V\u00ec v\u1eady, t\u00ean H\u1ed3ng Tuy\u00ean lu\u00f4n g\u1ee3i s\u1ef1 t\u01b0\u01a1i vui, xinh \u0111\u1eb9p,gi\u1ecfi gi\u1eafng v\u00e0 \u0111\u1ea7y s\u1ee9c s\u1ed1ng", "sex": 5}
{"first_name": "Ki\u1ec1u Tuy\u00ean", "meaning": "Theo ti\u1ebfng H\u00e1n, t\u00ean \"Ki\u1ec1u\" mang \u00fd ngh\u0129a l\u00e0 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, c\u00f3 nhan s\u1eafc rung \u0111\u1ed9ng l\u00f2ng ng\u01b0\u1eddi. T\u00ean Ki\u1ec1u Tuy\u00ean th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con g\u00e1i v\u1edbi mong mu\u1ed1n c\u00e1c b\u00e9 g\u00e1i khi l\u1edbn l\u00ean s\u1ebd c\u00f3 \u0111\u01b0\u1ee3c dung m\u1ea1o xinh x\u1eafn, duy\u00ean d\u00e1ng v\u00e0 t\u1ea1o \u1ea5n t\u01b0\u1ee3ng v\u1edbi m\u1ecdi ng\u01b0\u1eddi, \u0111\u1eb7c bi\u1ec7t s\u1edf h\u1eefu c\u1ea3 tr\u00ed tu\u1ec7 tinh th\u00f4ng, s\u00e1ng su\u1ed1t", "sex": 5}
{"first_name": "Minh Tuy\u00ean", "meaning": "Trong ti\u1ebfng H\u00e1n Vi\u1ec7t, b\u00ean c\u1ea1nh ngh\u0129a l\u00e0 \u00e1nh s\u00e1ng, s\u1ef1 th\u00f4ng minh t\u00e0i tr\u00ed \u0111\u01b0\u1ee3c \u01b0a d\u00f9ng khi \u0111\u1eb7t t\u00ean, Minh c\u00f2n c\u00f3 ngh\u0129a ch\u1ec9 c\u00e1c lo\u1ea1i c\u00e2y m\u1edbi nh\u00fa m\u1ea7m, ho\u1eb7c s\u1ef1 v\u1eadt m\u1edbi b\u1eaft \u0111\u1ea7u x\u1ea3y ra (b\u00ecnh minh) th\u1ec3 hi\u1ec7n s\u1ef1 kh\u1edfi t\u1ea1o nh\u1eefng \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p. T\u00ean Minh Tuy\u00ean th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi c\u00f3 tr\u00ed tu\u1ec7, th\u00f4ng minh, s\u00e1ng su\u1ed1t.", "sex": 3}
{"first_name": "Nh\u1eadt Tuy\u00ean", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, Nh\u1eadt c\u00f3 ngh\u0129a l\u00e0 m\u1eb7t tr\u1eddi, th\u00e1i d\u01b0\u01a1ng. Nh\u1eadt Tuy\u00ean l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi mong mu\u1ed1n v\u1ec1 s\u1ef1 th\u00f4ng minh, s\u00e1ng su\u1ed1t. Cha m\u1eb9 mong mu\u1ed1n cu\u1ed9c \u0111\u1eddi con s\u1ebd \u0111\u01b0\u1ee3c v\u1ea7ng th\u00e1i d\u01b0\u01a1ng sao s\u00e1ng v\u00e0 ch\u1edf che", "sex": 7}
{"first_name": "Ph\u01b0\u01a1ng Tuy\u00ean", "meaning": "Ch\u1eef  \"Ph\u01b0\u01a1ng\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t ngh\u0129a l\u00e0 h\u01b0\u1edbng, v\u1ecb tr\u00ed, \u0111\u1ea1o l\u00fd. T\u00ean \"Ph\u01b0\u01a1ng Tuy\u00ean\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi bi\u1ebft \u0111\u1ea1o l\u00fd l\u00e0m ng\u01b0\u1eddi, bi\u1ebft ph\u00e2n bi\u1ec7t t\u1ed1t x\u1ea5u, \u0111\u00fang sai. Th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi s\u00e1ng su\u1ed1t, tr\u00ed tu\u1ec7 tinh th\u00f4ng", "sex": 5}
{"first_name": "Xu\u00e2n Tuy\u00ean", "meaning": "Xu\u00e2n l\u00e0 m\u00f9a chuy\u1ec3n ti\u1ebfp t\u1eeb \u0111\u00f4ng sang h\u1ea1, th\u1eddi ti\u1ebft \u1ea5m \u00e1p, th\u01b0\u1eddng \u0111\u01b0\u1ee3c coi l\u00e0 m\u1edf \u0111\u1ea7u c\u1ee7a n\u0103m, m\u00f9a xu\u00e2n v\u1edbi ti\u1ebft tr\u1eddi se l\u1ea1nh, kh\u00f4ng kh\u00ed trong l\u00e0nh, tr\u0103m hoa \u0111ua n\u1edf. Xu\u00e2n Tuy\u00ean \u00fd n\u00f3i v\u1ec1 m\u1ed9t m\u00f9a xu\u00e2n r\u1ed9ng kh\u1eafp mu\u00f4n n\u01a1i, kh\u1eafp n\u01a1i h\u00e2n hoan ch\u00e0o \u0111\u00f3n. T\u00ean Xu\u00e2n Tuy\u00ean th\u1ec3 hi\u1ec7n m\u1ed9t ng\u01b0\u1eddi vui v\u1ebb, h\u1ed3n nhi\u00ean, cu\u1ed9c s\u1ed1ng sung t\u00fac, gi\u00e0u sang", "sex": 5}
