{"first_name": "Hoa Tuy\u1ebfn", "meaning": "Hoa l\u00e0 s\u1ef1  k\u1ebft tinh \u0111\u1eb9p \u0111\u1ebd c\u1ee7a tr\u1eddi \u0111\u1ea5t, hoa mang \u0111\u1ebfn s\u1ef1 sinh \u0111\u1ed9ng & t\u00f4 \u0111i\u1ec3m s\u1eafc m\u00e0u cho cu\u1ed9c s\u1ed1ng. M\u1ed7i lo\u00e0i hoa th\u01b0\u1eddng mang m\u1ed9t \u00fd ngh\u0129a kh\u00e1c nhau t\u01b0\u1ee3ng tr\u01b0ng cho nh\u1eefng t\u00ednh c\u00e1ch, ph\u1ea9m ch\u1ea5t kh\u00e1c nhau c\u1ee7a con ng\u01b0\u1eddi, nh\u01b0ng nh\u00ecn chung hoa l\u00e0 bi\u1ec3u t\u01b0\u1ee3ng d\u00e0nh cho ph\u00e1i \u0111\u1eb9p. T\u00ean \"Hoa Tuy\u1ebfn\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho n\u1eef, ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi con g\u00e1i c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, thu h\u00fat, c\u00f3 hi\u1ec3u bi\u1ebft, ph\u00e2n bi\u1ec7t t\u1ed1t x\u1ea5u, thi\u1ec7n \u00e1c, g\u1eb7p nhi\u1ec1u may m\u1eafn, b\u00ecnh y\u00ean", "sex": 5}
{"first_name": "Kim Tuy\u1ebfn", "meaning": "\"Kim\" theo ti\u1ebfng H\u00e1n - Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ti\u1ec1n, l\u00e0 v\u00e0ng. T\u00ean \"Kim Tuy\u1ebfn\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c cha m\u1eb9 \u0111\u1eb7t v\u1edbi h\u00e0m \u00fd mong mu\u1ed1n cu\u1ed9c s\u1ed1ng sung t\u00fac, ph\u00fa qu\u00fd v\u1eefng b\u1ec1n, ki\u00ean c\u1ed1 d\u00e0nh cho con c\u00e1i. Ngo\u00e0i ra \"Kim Tuy\u1ebfn\" c\u00f2n th\u1ec3 hi\u1ec7n \u0111\u01b0\u1ee3c s\u1ef1 ngay th\u1eb3ng, ch\u00e2n th\u1eadt", "sex": 5}
{"first_name": "L\u00e2m Tuy\u1ebfn", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"L\u00e2m\" c\u00f3 ngh\u0129a l\u00e0 r\u1eebng, m\u1ed9t ngu\u1ed3n t\u00e0i nguy\u00ean qu\u00fd c\u00f3 gi\u00e1 tr\u1ecb to l\u1edbn v\u1edbi \u0111\u1eddi s\u1ed1ng. T\u00ean \"L\u00e2m Tuy\u1ebfn\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi b\u00ecnh d\u1ecb, d\u1ec5 g\u1ea7n nh\u01b0 l\u1ebd t\u1ef1 nhi\u00ean nh\u01b0ng c\u0169ng m\u1ea1nh m\u1ebd & \u0111\u1ea7y uy l\u1ef1c", "sex": 7}
{"first_name": "Lan Tuy\u1ebfn", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Lan\" l\u00e0 t\u00ean m\u1ed9t lo\u00e0i hoa qu\u00fd, c\u00f3 h\u01b0\u01a1ng th\u01a1m & s\u1eafc \u0111\u1eb9p. T\u00ean \"Lan Tuy\u1ebfn\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t cho con g\u00e1i v\u1edbi mong mu\u1ed1n con l\u1edbn l\u00ean dung m\u1ea1o xinh \u0111\u1eb9p, t\u00e2m h\u1ed3n thanh cao, t\u00ednh t\u00ecnh d\u1ecbu d\u00e0ng, nh\u1eb9 nh\u00e0ng, s\u1ed1ng c\u00f3 hi\u1ec3u bi\u1ebft", "sex": 5}
{"first_name": "Linh Tuy\u1ebfn", "meaning": "Theo ti\u1ebfng H\u00e1n - Vi\u1ec7t, \"Linh\" c\u00f3 ngh\u0129a l\u00e0 c\u00e1i chu\u00f4ng nh\u1ecf \u0111\u00e1ng y\u00eau, ngo\u00e0i ra \"Linh\" c\u00f2n l\u00e0 t\u1eeb \u0111\u1ec3 ch\u1ec9 tinh th\u1ea7n con ng\u01b0\u1eddi, tin t\u01b0\u1edfng v\u00e0o nh\u1eefng \u0111i\u1ec1u k\u00ec di\u1ec7u, \"Linh\" c\u00f2n c\u00f3 ngh\u0129a l\u00e0 nhanh nh\u1eb9n, th\u00f4ng minh. T\u00ean \"Linh Tuy\u1ebfn\" th\u01b0\u1eddng \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi h\u00e0m \u00fd t\u1ed1t l\u00e0nh, th\u1ec3 hi\u1ec7n s\u1ef1 \u1ee9ng nghi\u1ec7m m\u00e0u nhi\u1ec7m c\u1ee7a nh\u1eefng \u0111i\u1ec1u th\u1ea7n k\u00ec, ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi dung m\u1ea1o \u0111\u00e1ng y\u00eau, t\u00e0i hoa, tinh anh, nhanh nh\u1eb9n, th\u00f4ng minh & lu\u00f4n g\u1eb7p may m\u1eafn, \u0111\u01b0\u1ee3c che ch\u1edf, gi\u00fap \u0111\u1ee1 trong cu\u1ed9c s\u1ed1ng.", "sex": 5}
{"first_name": "Ng\u00e2n Tuy\u1ebfn", "meaning": "Ng\u00e2n theo ti\u1ebfng H\u00e1n Vi\u1ec7t c\u00f3 ngh\u0129a l\u00e0 ti\u1ec1n. Th\u1ec3 hi\u1ec7n s\u1ef1 qu\u00fd b\u00e1u. T\u00ean Ng\u00e2n Tuy\u1ebfn mang \u00fd ngh\u0129a con l\u00e0 t\u00e0i s\u1ea3n qu\u00fd gi\u00e1 c\u1ee7a cha m\u1eb9 hay c\u00f2n c\u00f3 th\u1ec3 hi\u1ec3u l\u00e0 cha m\u1eb9 mong mu\u1ed1n t\u01b0\u01a1ng lai con lu\u00f4n \u0111\u01b0\u1ee3c \u0111\u1ee7 \u0111\u1ea7y, sung s\u01b0\u1edbng, g\u1eb7p nhi\u1ec1u may m\u1eafn, t\u1ed1t \u0111\u1eb9p", "sex": 5}
{"first_name": "Nh\u1eadt Tuy\u1ebfn", "meaning": "Theo ngh\u0129a H\u00e1n Vi\u1ec7t, Nh\u1eadt c\u00f3 ngh\u0129a l\u00e0 m\u1eb7t tr\u1eddi, th\u00e1i d\u01b0\u01a1ng. Tuy\u1ebfn c\u00f3 ngh\u0129a l\u00e0 ranh gi\u1edbi r\u1ea1ch r\u00f2i. Nh\u1eadt Tuy\u1ebfn \u00fd ch\u1ec9 ban ng\u00e0y, th\u1eddi \u0111i\u1ec3m \u00e1nh s\u00e1ng m\u1ea1t tr\u1eddi v\u1eabn c\u00f2n s\u00e1ng soi. T\u00ean Nh\u1eadt Tuy\u1ebfn \u0111\u01b0\u1ee3c \u0111\u1eb7t v\u1edbi hy v\u1ecdng con s\u1ebd c\u00f3 cu\u1ed9c \u0111\u1eddi t\u01b0\u01a1i s\u00e1ng, th\u00f4ng minh, t\u00e0i gi\u1ecfi, g\u1eb7p nhi\u1ec1u may m\u1eafn, b\u00ecnh y\u00ean", "sex": 3}
