{"first_name": "M\u1eabn Tuy\u1ec1n", "meaning": "\"M\u1eabn\" c\u00f3 ngh\u0129a l\u00e0 minh m\u1eabn, s\u00e1ng su\u1ed1t. \"Tuy\u1ec1n\" ngh\u0129a l\u00e0 d\u00f2ng s\u00f4ng. \"M\u1eabn Tuy\u1ec1n\" ngh\u0129a l\u00e0 d\u00f2ng s\u00f4ng s\u00e1ng, h\u00e0m \u00fd n\u00f3i con th\u00f4ng minh, m\u1ec1m m\u1ea1i, nh\u1eb9 nh\u00e0ng nh\u01b0ng \u0111\u1ea7y tinh t\u1ebf, \u00fd nh\u1ecb, lu\u00f4n s\u00e1ng su\u1ed1t nh\u00ecn nh\u1eadn v\u1ea5n \u0111\u1ec1.", "sex": 5}
{"first_name": "Nam Tuy\u1ec1n", "meaning": "\"Nam\" c\u00f3 \u00fd ngh\u0129a nh\u01b0 kim nam ch\u00e2m trong la b\u00e0n, lu\u00f4n lu\u00f4n ch\u1ec9 \u0111\u00fang v\u1ec1 ph\u00eda nam, nh\u1eb1m mong mu\u1ed1n s\u1ef1 s\u00e1ng su\u1ed1t, c\u00f3 \u0111\u01b0\u1eddng l\u1ed1i \u0111\u00fang \u0111\u1eafn \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t b\u1eadc nam nhi \u0111\u00fang ngh\u0129a. T\u00ean Nam Tuy\u1ec1n ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi c\u00f3 t\u00ednh c\u00e1ch trong s\u1ea1ch, \u0111i\u1ec1m \u0111\u1ea1m, lu\u00f4n tinh th\u1ea7n b\u00ecnh t\u0129nh, th\u00e1i \u0111\u1ed9 an nhi\u00ean tr\u01b0\u1edbc m\u1ecdi bi\u1ebfn c\u1ed1 c\u1ee7a cu\u1ed9c \u0111\u1eddi", "sex": 5}
{"first_name": "Ng\u1ecdc Tuy\u1ec1n", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Ng\u1ecdc Tuy\u1ec1n\" c\u00f3 ngh\u0129a l\u00e0 su\u1ed1i ng\u1ecdc. T\u00ean \"Ng\u1ecdc Tuy\u1ec1n\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 nh\u1eefng ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, d\u1ecbu d\u00e0ng, tinh th\u1ea7n th\u01b0 th\u00e1i, thanh cao, t\u00e2m trong s\u00e1ng nh\u01b0 d\u00f2ng su\u1ed1i ng\u1ecdc. \"Ng\u1ecdc Tuy\u1ec1n\" l\u00e0 c\u00e1i t\u00ean \u0111\u01b0\u1ee3c ba m\u1eb9 g\u1eedi g\u1eafm r\u1ea5t nhi\u1ec1u th\u00f4ng \u0111i\u1ec7p mong, con g\u00e1i c\u00f3 \u0111\u1ee7 m\u1ecdi t\u1ed1 ch\u1ea5t \u0111\u1ec3 tr\u1edf th\u00e0nh m\u1ed9t ng\u01b0\u1eddi phu\u0323 n\u01b0\u0303 \u0111\u00e1ng y\u00eau, \u0111\u1ee9c h\u1ea1nh.", "sex": 5}
{"first_name": "Nhi Tuy\u1ec1n", "meaning": "\"Nhi\" c\u00f3 ngh\u0129a l\u00e0 nh\u1ecf nh\u1eafn, \u0111\u00e1ng y\u00eau; \"Tuy\u1ec1n\" l\u00e0 d\u00f2ng su\u1ed1i. \"Nhi Tuy\u1ec1n\" ngh\u0129a l\u00e0 cha m\u1eb9 mong con lu\u00f4n xinh \u0111\u1eb9p, \u0111\u00e1ng y\u00eau v\u00e0 nh\u01b0 h\u00ecnh \u1ea3nh d\u00f2ng su\u1ed1i nh\u1eb9 nh\u00e0ng, con s\u1ebd c\u00f3 t\u00ednh c\u00e1ch trong s\u1ea1ch, \u0111i\u1ec1m \u0111\u1ea1m.", "sex": 5}
