{"first_name": "Chi Tuy\u1ebft", "meaning": "\"Chi Tuy\u1ebft\" l\u00e0 t\u00ean ph\u1ed5 bi\u1ebfn th\u01b0\u1eddng d\u00f9ng \u0111\u1ec3 \u0111\u1eb7t t\u00ean cho c\u00e1c b\u00e9 g\u00e1i \u1edf Vi\u1ec7t Nam v\u1edbi \"Tuy\u1ebft\" c\u00f3 ngh\u0129a l\u00e0 tr\u1eafng, tinh kh\u00f4i, \u0111\u1eb9p \u0111\u1ebd.  \"Chi\" nghi\u0303a la\u0300 ca\u0300nh, trong ca\u0300nh c\u00e2y, ca\u0300nh nha\u0301nh \u00fd ch\u1ec9 con ch\u00e1u, d\u00f2ng d\u00f5i.  L\u00e0 ch\u1eef \"Chi\" trong Kim Chi Ng\u1ecdc Di\u1ec7p \u00fd ch\u1ec9 \u0111\u1ec3 ch\u1ec9 s\u1ef1 cao sang qu\u00fd ph\u00e1i c\u1ee7a c\u00e0nh v\u00e0ng l\u00e1 ng\u1ecdc.", "sex": 5}
