{"first_name": "H\u00e2n Tuy\u1ebft", "meaning": "\"H\u00e2n\" theo ngh\u0129a H\u00e1n - Vi\u1ec7t l\u00e0 s\u1ef1 vui m\u1eebng hay l\u00fac h\u1eebng \u0111\u00f4ng khi m\u1eb7t tr\u1eddi m\u1ecdc, h\u00e0m ch\u1ee9a ni\u1ec1m vui, s\u1ef1 h\u1edbn h\u1edf cho nh\u1eefng kh\u1edfi \u0111\u1ea7u m\u1edbi t\u1ed1t \u0111\u1eb9p. \"H\u00e2n Tuy\u1ebft\" g\u1ee3i \u0111\u1ebfn h\u00ecnh \u1ea3nh tuy\u1ebft r\u01a1i v\u00e0o bu\u1ed5i s\u00e1ng, nh\u00ecn r\u1ea5t thanh khi\u1ebft v\u00e0 nh\u1eb9 nh\u00e0ng, kh\u00f4ng kh\u00ed trong l\u00e0nh, b\u00ecnh y\u00ean. T\u00ean \"H\u00e2n Tuy\u1ebft\" th\u1ec3 hi\u1ec7n ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p,t\u00e2m h\u1ed3n trong s\u00e1ng, thanh cao v\u00e0 lu\u00f4n vui v\u1ebb", "sex": 5}
