{"first_name": "Nga Tuy\u1ebft", "meaning": "\"Nga\" l\u00e0 t\u1eeb hoa m\u1ef9 d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p, th\u01b0\u1edbt tha xinh nh\u01b0 ti\u00ean. \"Tuy\u1ebft\" trong t\u00ean g\u1ecdi th\u01b0\u1eddng \u0111\u01b0\u1ee3c hi\u1ec3u l\u00e0 con g\u00e1i c\u00f3 t\u00ednh n\u1ebft trong tr\u1eafng, thu\u1ea7n khi\u1ebft nh\u01b0 tuy\u1ebft. \"Nga Tuy\u1ebft\" l\u00e0 ng\u01b0\u1eddi con g\u00e1i \u0111\u1eb9p v\u00e0 thu\u1ea7n khi\u1ebft.", "sex": 5}
