{"first_name": "Sam Tuy\u1ebft", "meaning": "Theo ngh\u0129a g\u1ed1c H\u00e1n, \"Tuy\u1ebft\" l\u00e0 tinh th\u1ec3 b\u0103ng nh\u1ecf v\u00e0 tr\u1eafng k\u1ebft tinh th\u00e0nh kh\u1ed1i x\u1ed1p, nh\u1eb9, r\u01a1i \u1edf v\u00f9ng c\u00f3 kh\u00ed h\u1eadu l\u1ea1nh. \"Sam\" c\u00f3 ngh\u0129a l\u00e0 s\u1eafc, b\u00e9n, nh\u1ecdn. Ngo\u00e0i ra \"Sam\" c\u00f2n l\u00e0 t\u00ean m\u1ed9t lo\u00e0i \u0111\u1ed9ng v\u1eadt ch\u00e2n \u0111\u1ed1t \u1edf bi\u1ec3n t\u01b0\u1ee3ng tr\u01b0ng cho s\u1ef1 th\u1ee7y chung, son s\u1eafc, s\u1ed1ng c\u00f3 t\u00ecnh c\u00f3 ngh\u0129a. Ng\u01b0\u1eddi t\u00ean \"Sam Tuy\u1ebft\" th\u01b0\u1eddng l\u00e0 ng\u01b0\u1eddi th\u00f4ng minh, s\u1eafc s\u1ea3o, s\u1ed1ng kh\u00f4n kh\u00e9o, hi\u1ec3u bi\u1ebft, c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, trong tr\u1eafng, tinh kh\u00f4i, thanh cao v\u00e0 quy\u1ec1n qu\u00fd.", "sex": 5}
{"first_name": "S\u01b0\u01a1ng Tuy\u1ebft", "meaning": "Hai h\u00ecnh \u1ea3nh \"Tuy\u1ebft\" v\u00e0 \"S\u01b0\u01a1ng\" \u0111\u1ec1u \u0111\u1ea1i di\u1ec7n cho s\u1ef1 thanh cao, trong ng\u1ea7n v\u00e0 tinh khi\u1ebft. \"S\u01b0\u01a1ng Tuy\u1ebft\" mang \u00fd ngh\u0129a mong con lu\u00f4n gi\u1eef \u0111\u01b0\u1ee3c t\u00e2m h\u1ed3n trong tr\u1ebbo nh\u01b0 s\u01b0\u01a1ng, tinh khi\u1ebft nh\u01b0 tuy\u1ebft.", "sex": 5}
{"first_name": "Thanh Tuy\u1ebft", "meaning": "Theo ngh\u0129a H\u00e1n - Vi\u1ec7t, \"Thanh\" c\u00f3 ngh\u0129a l\u00e0 trong s\u00e1ng, trong s\u1ea1ch, thanh khi\u1ebft. T\u00ean \"Thanh Tuy\u1ebft\" d\u00f9ng \u0111\u1ec3 g\u1ee3i \u0111\u1ebfn h\u00ecnh \u1ea3nh ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p, trong s\u00e1ng, thanh khi\u1ebft, tinh kh\u00f4i, lu\u00f4n bi\u1ebft gi\u1eef m\u00ecnh trong s\u1ea1ch, kh\u00f4ng b\u1ecb c\u00e1m d\u1ed7.", "sex": 5}
{"first_name": "Xoan Tuy\u1ebft", "meaning": "\"Tuy\u1ebft\" g\u1ee3i \u0111\u1ebfn s\u1ef1 xinh \u0111\u1eb9p, trong tr\u1eafng, tinh kh\u00f4i, thanh cao v\u00e0 quy\u1ec1n qu\u00fd nh\u01b0 nh\u1eefng b\u00f4ng hoa tuy\u1ebft. \"Xoan Tuy\u1ebft\", con l\u00e0 ng\u01b0\u1eddi con g\u00e1i xinh \u0111\u1eb9p tinh kh\u00f4i v\u00e0 cao qu\u00fd trong s\u00e1ng nh\u01b0 nh\u1eefng b\u00f4ng hoa tuy\u1ebft.", "sex": 5}
{"first_name": "Y\u00ean Tuy\u1ebft", "meaning": "\"Tuy\u1ebft\" d\u00f9ng \u0111\u1ec3 ch\u1ec9 ng\u01b0\u1eddi c\u00f3 dung m\u1ea1o xinh \u0111\u1eb9p, s\u00e1ng ng\u1eddi, m\u1ed9t ph\u1ea9m ch\u1ea5t cao qu\u00fd, thanh tao. \"Y\u00ean Tuy\u1ebft\", con l\u00e0 ng\u01b0\u1eddi xinh \u0111\u1eb9p trong s\u00e1ng v\u00e0 r\u1ea1ng ng\u1eddi nh\u01b0 tuy\u1ebft, cu\u1ed9c s\u1ed1ng c\u1ee7a con an nh\u00e0n gi\u1ea3n d\u1ecb.", "sex": 5}
{"first_name": "Mai Tuy\u1ebft\u00a0", "meaning": "\"Mai\" l\u00e0 t\u00ean lo\u00e0i hoa n\u1edf v\u00e0o m\u00f9a xu\u00e2n, b\u00e1o hi\u1ec7u ni\u1ec1m vui, \u0111\u1ea7y hy v\u1ecdng. \"Tuy\u1ebft\" l\u00e0 m\u1ed9t d\u1ea1ng c\u1ee7a b\u0103ng, tr\u1eafng trong, tinh khi\u1ebft. \"Mai Tuy\u1ebft\" ngh\u0129a l\u00e0 hoa mai trong tuy\u1ebft, xinh \u0111\u1eb9p, t\u01b0\u01a1i t\u1eafn, trong s\u00e1ng, thanh khi\u1ebft.", "sex": 5}
{"first_name": "Tr\u1ecdng Tuy\u1ec3n", "meaning": "\"Tr\u1ecdng\" l\u00e0 n\u1eb7ng. \"Tr\u1ecdng Tuy\u1ec3n\" ngh\u0129a l\u00e0 l\u1ef1a ch\u1ecdn chu \u0111\u00e1o, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi c\u00f3 c\u00e1 t\u00ednh c\u1ea9n th\u1eadn, c\u00e2n nh\u1eafc m\u1ecdi vi\u1ec7c r\u00f5 r\u00e0ng.", "sex": 3}
{"first_name": "Xu\u00e2n T\u00fd", "meaning": "\"Xu\u00e2n\" l\u00e0 m\u00f9a xu\u00e2n. \"Xu\u00e2n T\u00fd\" l\u00e0 \u0111\u01b0\u1ee3c che ch\u1edf b\u1edfi m\u00f9a xu\u00e2n, th\u1ec3 hi\u1ec7n con ng\u01b0\u1eddi h\u1ea1nh ph\u01b0\u1edbc tr\u00e0n \u0111\u1ea7y, m\u1ecdi \u0111i\u1ec1u t\u1ed1t \u0111\u1eb9p", "sex": 3}
{"first_name": "B\u00edch Ty", "meaning": "\"B\u00edch Ty\" l\u00e0 s\u1ee3i t\u01a1 xanh bi\u1ebfc, ch\u1ec9 con ng\u01b0\u1eddi g\u00e1i xinh \u0111\u1eb9p ki\u1ec1u di\u1ec5m, tinh t\u1ebf duy\u00ean d\u00e1ng.", "sex": 5}
